var quran_default = [{ id: 1, name: "\u0627\u0644\u0641\u0627\u062A\u062D\u0629", transliteration: "Al-Fatihah", type: "meccan", total_verses: 7, verses: [{ id: 1, text: "\u0628\u0650\u0633\u06E1\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 2, text: "\u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 3, text: "\u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 4, text: "\u0645\u064E\u0670\u0644\u0650\u0643\u0650 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 5, text: "\u0625\u0650\u064A\u0651\u064E\u0627\u0643\u064E \u0646\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0648\u064E\u0625\u0650\u064A\u0651\u064E\u0627\u0643\u064E \u0646\u064E\u0633\u06E1\u062A\u064E\u0639\u0650\u064A\u0646\u064F" }, { id: 6, text: "\u0671\u0647\u06E1\u062F\u0650\u0646\u064E\u0627 \u0671\u0644\u0635\u0651\u0650\u0631\u064E\u0670\u0637\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u064E" }, { id: 7, text: "\u0635\u0650\u0631\u064E\u0670\u0637\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0636\u064F\u0648\u0628\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u0636\u0651\u064E\u0627\u0653\u0644\u0651\u0650\u064A\u0646\u064E" }] }, { id: 2, name: "\u0627\u0644\u0628\u0642\u0631\u0629", transliteration: "Al-Baqarah", type: "medinan", total_verses: 286, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0645\u0653" }, { id: 2, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064F \u0644\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E\u06DB \u0641\u0650\u064A\u0647\u0650\u06DB \u0647\u064F\u062F\u0657\u0649 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 3, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u064A\u064F\u0642\u0650\u064A\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0647\u064F\u062F\u0657\u0649 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0623\u064E\u0646\u0630\u064E\u0631\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1 \u0644\u064E\u0645\u06E1 \u062A\u064F\u0646\u0630\u0650\u0631\u06E1\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u062E\u064E\u062A\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064E\u0645\u06E1\u0639\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u063A\u0650\u0634\u064E\u0670\u0648\u064E\u0629\u065E\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 8, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0628\u0650\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u064A\u064F\u062E\u064E\u0670\u062F\u0650\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062E\u06E1\u062F\u064E\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u065E \u0641\u064E\u0632\u064E\u0627\u062F\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0631\u064E\u0636\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0645\u064F\u0635\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0643\u064E\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0671\u0644\u0633\u0651\u064F\u0641\u064E\u0647\u064E\u0627\u0653\u0621\u064F\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0647\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064F\u0641\u064E\u0647\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0644\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062E\u064E\u0644\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0645\u064F\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0626\u064F \u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u0645\u064F\u062F\u0651\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0637\u064F\u063A\u06E1\u064A\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0645\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0634\u06E1\u062A\u064E\u0631\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0636\u0651\u064E\u0644\u064E\u0670\u0644\u064E\u0629\u064E \u0628\u0650\u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0641\u064E\u0645\u064E\u0627 \u0631\u064E\u0628\u0650\u062D\u064E\u062A \u062A\u0651\u0650\u062C\u064E\u0670\u0631\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u0645\u064E\u062B\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0671\u0633\u06E1\u062A\u064E\u0648\u06E1\u0642\u064E\u062F\u064E \u0646\u064E\u0627\u0631\u0657\u0627 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0636\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0645\u064E\u0627 \u062D\u064E\u0648\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0630\u064E\u0647\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0646\u064F\u0648\u0631\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u062A\u064E\u0631\u064E\u0643\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0638\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0635\u064F\u0645\u0651\u064F\u06E2 \u0628\u064F\u0643\u06E1\u0645\u064C \u0639\u064F\u0645\u06E1\u064A\u065E \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0623\u064E\u0648\u06E1 \u0643\u064E\u0635\u064E\u064A\u0651\u0650\u0628\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0641\u0650\u064A\u0647\u0650 \u0638\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u065E \u0648\u064E\u0631\u064E\u0639\u06E1\u062F\u065E \u0648\u064E\u0628\u064E\u0631\u06E1\u0642\u065E \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u0635\u064E\u0670\u0628\u0650\u0639\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0648\u064E\u0670\u0639\u0650\u0642\u0650 \u062D\u064E\u0630\u064E\u0631\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064F\u062D\u0650\u064A\u0637\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 20, text: "\u064A\u064E\u0643\u064E\u0627\u062F\u064F \u0671\u0644\u06E1\u0628\u064E\u0631\u06E1\u0642\u064F \u064A\u064E\u062E\u06E1\u0637\u064E\u0641\u064F \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0636\u064E\u0627\u0653\u0621\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0634\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0630\u064E\u0647\u064E\u0628\u064E \u0628\u0650\u0633\u064E\u0645\u06E1\u0639\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 21, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0641\u0650\u0631\u064E\u0670\u0634\u0657\u0627 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0646\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u064E \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u0631\u0650\u0632\u06E1\u0642\u0657\u0627 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646\u062F\u064E\u0627\u062F\u0657\u0627 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0631\u064E\u064A\u06E1\u0628\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u0628\u06E1\u062F\u0650\u0646\u064E\u0627 \u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0633\u064F\u0648\u0631\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0645\u0651\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 24, text: "\u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0646 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0648\u064E\u0642\u064F\u0648\u062F\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u062C\u064E\u0627\u0631\u064E\u0629\u064F\u06D6 \u0623\u064F\u0639\u0650\u062F\u0651\u064E\u062A\u06E1 \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06D6 \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627 \u0631\u064F\u0632\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0645\u0650\u0646 \u062B\u064E\u0645\u064E\u0631\u064E\u0629\u0656 \u0631\u0651\u0650\u0632\u06E1\u0642\u0657\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0631\u064F\u0632\u0650\u0642\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0648\u064E\u0623\u064F\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0645\u064F\u062A\u064E\u0634\u064E\u0670\u0628\u0650\u0647\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u065E \u0645\u0651\u064F\u0637\u064E\u0647\u0651\u064E\u0631\u064E\u0629\u065E\u06D6 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u062D\u06E1\u064A\u0650\u06E6\u0653 \u0623\u064E\u0646 \u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u064E \u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u0628\u064E\u0639\u064F\u0648\u0636\u064E\u0629\u0657 \u0641\u064E\u0645\u064E\u0627 \u0641\u064E\u0648\u06E1\u0642\u064E\u0647\u064E\u0627\u06DA \u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0641\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0630\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u064E\u062B\u064E\u0644\u0657\u0627\u06D8 \u064A\u064F\u0636\u0650\u0644\u0651\u064F \u0628\u0650\u0647\u0650\u06E6 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0628\u0650\u0647\u0650\u06E6 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0636\u0650\u0644\u0651\u064F \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 27, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0646\u0642\u064F\u0636\u064F\u0648\u0646\u064E \u0639\u064E\u0647\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0642\u06E1\u0637\u064E\u0639\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u064E\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646 \u064A\u064F\u0648\u0635\u064E\u0644\u064E \u0648\u064E\u064A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u062A\u0657\u0627 \u0641\u064E\u0623\u064E\u062D\u06E1\u064A\u064E\u0670\u0643\u064F\u0645\u06E1\u06D6 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0645\u0650\u064A\u062A\u064F\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u062D\u06E1\u064A\u0650\u064A\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0641\u064E\u0633\u064E\u0648\u0651\u064E\u0649\u0670\u0647\u064F\u0646\u0651\u064E \u0633\u064E\u0628\u06E1\u0639\u064E \u0633\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0656\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 30, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0644\u0650\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u062C\u064E\u0627\u0639\u0650\u0644\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062E\u064E\u0644\u0650\u064A\u0641\u064E\u0629\u0657\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0646 \u064A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u064A\u064E\u0633\u06E1\u0641\u0650\u0643\u064F \u0671\u0644\u062F\u0651\u0650\u0645\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0646\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650\u0643\u064E \u0648\u064E\u0646\u064F\u0642\u064E\u062F\u0651\u0650\u0633\u064F \u0644\u064E\u0643\u064E\u06D6 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0648\u064E\u0639\u064E\u0644\u0651\u064E\u0645\u064E \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0621\u064E \u0643\u064F\u0644\u0651\u064E\u0647\u064E\u0627 \u062B\u064F\u0645\u0651\u064E \u0639\u064E\u0631\u064E\u0636\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0646\u06E2\u0628\u0650\u0640\u0654\u064F\u0648\u0646\u0650\u064A \u0628\u0650\u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0621\u0650 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0643\u064E \u0644\u064E\u0627 \u0639\u0650\u0644\u06E1\u0645\u064E \u0644\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0639\u064E\u0644\u0651\u064E\u0645\u06E1\u062A\u064E\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 33, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0640\u0670\u0653\u0640\u0654\u064E\u0627\u062F\u064E\u0645\u064F \u0623\u064E\u0646\u06E2\u0628\u0650\u0626\u06E1\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u06E2\u0628\u064E\u0623\u064E\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0644\u064E\u0645\u06E1 \u0623\u064E\u0642\u064F\u0644 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u063A\u064E\u064A\u06E1\u0628\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064F\u0628\u06E1\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0671\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652 \u0644\u0650\u0623\u0653\u062F\u064E\u0645\u064E \u0641\u064E\u0633\u064E\u062C\u064E\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064E \u0623\u064E\u0628\u064E\u0649\u0670 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064E \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 35, text: "\u0648\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u064A\u064E\u0640\u0670\u0653\u0640\u0654\u064E\u0627\u062F\u064E\u0645\u064F \u0671\u0633\u06E1\u0643\u064F\u0646\u06E1 \u0623\u064E\u0646\u062A\u064E \u0648\u064E\u0632\u064E\u0648\u06E1\u062C\u064F\u0643\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0648\u064E\u0643\u064F\u0644\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0631\u064E\u063A\u064E\u062F\u064B\u0627 \u062D\u064E\u064A\u06E1\u062B\u064F \u0634\u0650\u0626\u06E1\u062A\u064F\u0645\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0631\u064E\u0628\u064E\u0627 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u064E\u0629\u064E \u0641\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 36, text: "\u0641\u064E\u0623\u064E\u0632\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E\u0647\u064F\u0645\u064E\u0627 \u0645\u0650\u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u0650\u06D6 \u0648\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0671\u0647\u06E1\u0628\u0650\u0637\u064F\u0648\u0627\u0652 \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645\u06E1 \u0644\u0650\u0628\u064E\u0639\u06E1\u0636\u064D \u0639\u064E\u062F\u064F\u0648\u0651\u065E\u06D6 \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u065E \u0648\u064E\u0645\u064E\u062A\u064E\u0670\u0639\u064C \u0625\u0650\u0644\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 37, text: "\u0641\u064E\u062A\u064E\u0644\u064E\u0642\u0651\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0656 \u0641\u064E\u062A\u064E\u0627\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u0651\u064E\u0627\u0628\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 38, text: "\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0671\u0647\u06E1\u0628\u0650\u0637\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627\u06D6 \u0641\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u0651\u0650\u064A \u0647\u064F\u062F\u0657\u0649 \u0641\u064E\u0645\u064E\u0646 \u062A\u064E\u0628\u0650\u0639\u064E \u0647\u064F\u062F\u064E\u0627\u064A\u064E \u0641\u064E\u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u062A\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0648\u06E1\u0641\u064F\u0648\u0627\u0652 \u0628\u0650\u0639\u064E\u0647\u06E1\u062F\u0650\u064A\u0653 \u0623\u064F\u0648\u0641\u0650 \u0628\u0650\u0639\u064E\u0647\u06E1\u062F\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u064A\u0651\u064E\u0640\u0670\u064A\u064E \u0641\u064E\u0671\u0631\u06E1\u0647\u064E\u0628\u064F\u0648\u0646\u0650" }, { id: 41, text: "\u0648\u064E\u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u062A\u064F \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0643\u064E\u0627\u0641\u0650\u0631\u0650\u06ED \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0634\u06E1\u062A\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u062B\u064E\u0645\u064E\u0646\u0657\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0648\u064E\u0625\u0650\u064A\u0651\u064E\u0640\u0670\u064A\u064E \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u0650" }, { id: 42, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0644\u06E1\u0628\u0650\u0633\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u0648\u064E\u062A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0671\u0631\u06E1\u0643\u064E\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0643\u0650\u0639\u0650\u064A\u0646\u064E" }, { id: 44, text: "\u06DE\u0623\u064E\u062A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0628\u0650\u0671\u0644\u06E1\u0628\u0650\u0631\u0651\u0650 \u0648\u064E\u062A\u064E\u0646\u0633\u064E\u0648\u06E1\u0646\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u062A\u06E1\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0639\u0650\u064A\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0635\u0651\u064E\u0628\u06E1\u0631\u0650 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0644\u064E\u0643\u064E\u0628\u0650\u064A\u0631\u064E\u0629\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u062E\u064E\u0670\u0634\u0650\u0639\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0638\u064F\u0646\u0651\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0644\u064E\u0670\u0642\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0631\u064E\u0670\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u062A\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0651\u0650\u064A \u0641\u064E\u0636\u0651\u064E\u0644\u06E1\u062A\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u064A\u064E\u0648\u06E1\u0645\u0657\u0627 \u0644\u0651\u064E\u0627 \u062A\u064E\u062C\u06E1\u0632\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u064C \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0656 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0642\u06E1\u0628\u064E\u0644\u064F \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0634\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u062E\u064E\u0630\u064F \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0639\u064E\u062F\u06E1\u0644\u065E \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u0644\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u064A\u064E\u0633\u064F\u0648\u0645\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u064A\u064F\u0630\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0646\u064E \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062D\u06E1\u064A\u064F\u0648\u0646\u064E \u0646\u0650\u0633\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645 \u0628\u064E\u0644\u064E\u0627\u0653\u0621\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 50, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0641\u064E\u0631\u064E\u0642\u06E1\u0646\u064E\u0627 \u0628\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E \u0641\u064E\u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0648\u064E\u0670\u0639\u064E\u062F\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u0650\u064A\u0646\u064E \u0644\u064E\u064A\u06E1\u0644\u064E\u0629\u0657 \u062B\u064F\u0645\u0651\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u0650\u062C\u06E1\u0644\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0638\u064E\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u062B\u064F\u0645\u0651\u064E \u0639\u064E\u0641\u064E\u0648\u06E1\u0646\u064E\u0627 \u0639\u064E\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u0641\u064F\u0631\u06E1\u0642\u064E\u0627\u0646\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0638\u064E\u0644\u064E\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645 \u0628\u0650\u0671\u062A\u0651\u0650\u062E\u064E\u0627\u0630\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u0650\u062C\u06E1\u0644\u064E \u0641\u064E\u062A\u064F\u0648\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0627\u0631\u0650\u0626\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1 \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0628\u064E\u0627\u0631\u0650\u0626\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u062A\u064E\u0627\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u0651\u064E\u0627\u0628\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 55, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064F\u0644\u06E1\u062A\u064F\u0645\u06E1 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u064E\u0646 \u0646\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E \u0644\u064E\u0643\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0646\u064E\u0631\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062C\u064E\u0647\u06E1\u0631\u064E\u0629\u0657 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0639\u0650\u0642\u064E\u0629\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u062B\u064F\u0645\u0651\u064E \u0628\u064E\u0639\u064E\u062B\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0648\u06E1\u062A\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0648\u064E\u0638\u064E\u0644\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0645\u064E\u0627\u0645\u064E \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0646\u0651\u064E \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0644\u06E1\u0648\u064E\u0649\u0670\u06D6 \u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0645\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064E \u0641\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062D\u064E\u064A\u06E1\u062B\u064F \u0634\u0650\u0626\u06E1\u062A\u064F\u0645\u06E1 \u0631\u064E\u063A\u064E\u062F\u0657\u0627 \u0648\u064E\u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0628\u064E\u0627\u0628\u064E \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627 \u0648\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u062D\u0650\u0637\u0651\u064E\u0629\u065E \u0646\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u062E\u064E\u0637\u064E\u0670\u064A\u064E\u0670\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0633\u064E\u0646\u064E\u0632\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 59, text: "\u0641\u064E\u0628\u064E\u062F\u0651\u064E\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0644\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0631\u0650\u062C\u06E1\u0632\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0633\u064F\u0642\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u06DE\u0648\u064E\u0625\u0650\u0630\u0650 \u0671\u0633\u06E1\u062A\u064E\u0633\u06E1\u0642\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0641\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0671\u0636\u06E1\u0631\u0650\u0628 \u0628\u0651\u0650\u0639\u064E\u0635\u064E\u0627\u0643\u064E \u0671\u0644\u06E1\u062D\u064E\u062C\u064E\u0631\u064E\u06D6 \u0641\u064E\u0671\u0646\u0641\u064E\u062C\u064E\u0631\u064E\u062A\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064F \u0671\u062B\u06E1\u0646\u064E\u062A\u064E\u0627 \u0639\u064E\u0634\u06E1\u0631\u064E\u0629\u064E \u0639\u064E\u064A\u06E1\u0646\u0657\u0627\u06D6 \u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u064E \u0643\u064F\u0644\u0651\u064F \u0623\u064F\u0646\u064E\u0627\u0633\u0656 \u0645\u0651\u064E\u0634\u06E1\u0631\u064E\u0628\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0634\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0631\u0651\u0650\u0632\u06E1\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062B\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 61, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064F\u0644\u06E1\u062A\u064F\u0645\u06E1 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u064E\u0646 \u0646\u0651\u064E\u0635\u06E1\u0628\u0650\u0631\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0637\u064E\u0639\u064E\u0627\u0645\u0656 \u0648\u064E\u0670\u062D\u0650\u062F\u0656 \u0641\u064E\u0671\u062F\u06E1\u0639\u064F \u0644\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064F\u0646\u06E2\u0628\u0650\u062A\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u0642\u06E1\u0644\u0650\u0647\u064E\u0627 \u0648\u064E\u0642\u0650\u062B\u0651\u064E\u0627\u0653\u0626\u0650\u0647\u064E\u0627 \u0648\u064E\u0641\u064F\u0648\u0645\u0650\u0647\u064E\u0627 \u0648\u064E\u0639\u064E\u062F\u064E\u0633\u0650\u0647\u064E\u0627 \u0648\u064E\u0628\u064E\u0635\u064E\u0644\u0650\u0647\u064E\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u062A\u064E\u0633\u06E1\u062A\u064E\u0628\u06E1\u062F\u0650\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0647\u064F\u0648\u064E \u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u064C\u06DA \u0671\u0647\u06E1\u0628\u0650\u0637\u064F\u0648\u0627\u0652 \u0645\u0650\u0635\u06E1\u0631\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0636\u064F\u0631\u0650\u0628\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0630\u0651\u0650\u0644\u0651\u064E\u0629\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u0643\u064E\u0646\u064E\u0629\u064F \u0648\u064E\u0628\u064E\u0627\u0653\u0621\u064F\u0648 \u0628\u0650\u063A\u064E\u0636\u064E\u0628\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0635\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0640\u0654\u0650\u064A\u0646\u064E \u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0641\u064E\u0639\u06E1\u0646\u064E\u0627 \u0641\u064E\u0648\u06E1\u0642\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0637\u0651\u064F\u0648\u0631\u064E \u062E\u064F\u0630\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0628\u0650\u0642\u064F\u0648\u0651\u064E\u0629\u0656 \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0641\u0650\u064A\u0647\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064F\u0647\u064F\u06E5 \u0644\u064E\u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 65, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0639\u06E1\u062A\u064E\u062F\u064E\u0648\u06E1\u0627\u0652 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0628\u06E1\u062A\u0650 \u0641\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0642\u0650\u0631\u064E\u062F\u064E\u0629\u064B \u062E\u064E\u0670\u0633\u0650\u0640\u0654\u0650\u064A\u0646\u064E" }, { id: 66, text: "\u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0646\u064E\u0643\u064E\u0670\u0644\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u06E1\u0641\u064E\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0648\u06E1\u0639\u0650\u0638\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 67, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0630\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u0628\u064E\u0642\u064E\u0631\u064E\u0629\u0657\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0646\u064E\u0627 \u0647\u064F\u0632\u064F\u0648\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0639\u064F\u0648\u0630\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 68, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u062F\u06E1\u0639\u064F \u0644\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646 \u0644\u0651\u064E\u0646\u064E\u0627 \u0645\u064E\u0627 \u0647\u0650\u064A\u064E\u06DA \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0628\u064E\u0642\u064E\u0631\u064E\u0629\u065E \u0644\u0651\u064E\u0627 \u0641\u064E\u0627\u0631\u0650\u0636\u065E \u0648\u064E\u0644\u064E\u0627 \u0628\u0650\u0643\u06E1\u0631\u064C \u0639\u064E\u0648\u064E\u0627\u0646\u064F\u06E2 \u0628\u064E\u064A\u06E1\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0641\u064E\u0671\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u062A\u064F\u0624\u06E1\u0645\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u062F\u06E1\u0639\u064F \u0644\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646 \u0644\u0651\u064E\u0646\u064E\u0627 \u0645\u064E\u0627 \u0644\u064E\u0648\u06E1\u0646\u064F\u0647\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0628\u064E\u0642\u064E\u0631\u064E\u0629\u065E \u0635\u064E\u0641\u06E1\u0631\u064E\u0627\u0653\u0621\u064F \u0641\u064E\u0627\u0642\u0650\u0639\u065E \u0644\u0651\u064E\u0648\u06E1\u0646\u064F\u0647\u064E\u0627 \u062A\u064E\u0633\u064F\u0631\u0651\u064F \u0671\u0644\u0646\u0651\u064E\u0640\u0670\u0638\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 70, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u062F\u06E1\u0639\u064F \u0644\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646 \u0644\u0651\u064E\u0646\u064E\u0627 \u0645\u064E\u0627 \u0647\u0650\u064A\u064E \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0628\u064E\u0642\u064E\u0631\u064E \u062A\u064E\u0634\u064E\u0670\u0628\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0628\u064E\u0642\u064E\u0631\u064E\u0629\u065E \u0644\u0651\u064E\u0627 \u0630\u064E\u0644\u064F\u0648\u0644\u065E \u062A\u064F\u062B\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u0642\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u0631\u06E1\u062B\u064E \u0645\u064F\u0633\u064E\u0644\u0651\u064E\u0645\u064E\u0629\u065E \u0644\u0651\u064E\u0627 \u0634\u0650\u064A\u064E\u0629\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0640\u0654\u064E\u0670\u0646\u064E \u062C\u0650\u0626\u06E1\u062A\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0641\u064E\u0630\u064E\u0628\u064E\u062D\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u062A\u064E\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0646\u064E\u0641\u06E1\u0633\u0657\u0627 \u0641\u064E\u0671\u062F\u0651\u064E\u0640\u0670\u0631\u064E\u2009\u0670\u0654\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064F\u062E\u06E1\u0631\u0650\u062C\u065E \u0645\u0651\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0641\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0671\u0636\u06E1\u0631\u0650\u0628\u064F\u0648\u0647\u064F \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0650\u0647\u064E\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u0648\u064E\u064A\u064F\u0631\u0650\u064A\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 74, text: "\u062B\u064F\u0645\u0651\u064E \u0642\u064E\u0633\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0647\u0650\u064A\u064E \u0643\u064E\u0671\u0644\u06E1\u062D\u0650\u062C\u064E\u0627\u0631\u064E\u0629\u0650 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0642\u064E\u0633\u06E1\u0648\u064E\u0629\u0657\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u0650\u062C\u064E\u0627\u0631\u064E\u0629\u0650 \u0644\u064E\u0645\u064E\u0627 \u064A\u064E\u062A\u064E\u0641\u064E\u062C\u0651\u064E\u0631\u064F \u0645\u0650\u0646\u06E1\u0647\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0644\u064E\u0645\u064E\u0627 \u064A\u064E\u0634\u0651\u064E\u0642\u0651\u064E\u0642\u064F \u0641\u064E\u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646\u06E1\u0647\u064F \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0644\u064E\u0645\u064E\u0627 \u064A\u064E\u0647\u06E1\u0628\u0650\u0637\u064F \u0645\u0650\u0646\u06E1 \u062E\u064E\u0634\u06E1\u064A\u064E\u0629\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u063A\u064E\u0670\u0641\u0650\u0644\u064D \u0639\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 75, text: "\u06DE\u0623\u064E\u0641\u064E\u062A\u064E\u0637\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064E \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u0643\u064E\u0644\u064E\u0670\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u062D\u064E\u0631\u0651\u0650\u0641\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u0639\u064E\u0642\u064E\u0644\u064F\u0648\u0647\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0644\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062E\u064E\u0644\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062A\u064F\u062D\u064E\u062F\u0651\u0650\u062B\u064F\u0648\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0641\u064E\u062A\u064E\u062D\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0644\u0650\u064A\u064F\u062D\u064E\u0627\u0653\u062C\u0651\u064F\u0648\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 77, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u064A\u064F\u0633\u0650\u0631\u0651\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0639\u06E1\u0644\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 78, text: "\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064F\u0645\u0651\u0650\u064A\u0651\u064F\u0648\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0645\u064E\u0627\u0646\u0650\u064A\u0651\u064E \u0648\u064E\u0625\u0650\u0646\u06E1 \u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u064A\u064E\u0638\u064F\u0646\u0651\u064F\u0648\u0646\u064E" }, { id: 79, text: "\u0641\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0643\u06E1\u062A\u064F\u0628\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0628\u0650\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u0650\u064A\u064E\u0634\u06E1\u062A\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u062B\u064E\u0645\u064E\u0646\u0657\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627\u06D6 \u0641\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0643\u064E\u062A\u064E\u0628\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 80, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u062A\u064E\u0645\u064E\u0633\u0651\u064E\u0646\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0657\u0627 \u0645\u0651\u064E\u0639\u06E1\u062F\u064F\u0648\u062F\u064E\u0629\u0657\u06DA \u0642\u064F\u0644\u06E1 \u0623\u064E\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0647\u06E1\u062F\u0657\u0627 \u0641\u064E\u0644\u064E\u0646 \u064A\u064F\u062E\u06E1\u0644\u0650\u0641\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0647\u06E1\u062F\u064E\u0647\u064F\u06E5\u0653\u06D6 \u0623\u064E\u0645\u06E1 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0628\u064E\u0644\u064E\u0649\u0670\u06DA \u0645\u064E\u0646 \u0643\u064E\u0633\u064E\u0628\u064E \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u062D\u064E\u0670\u0637\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u062E\u064E\u0637\u0650\u064A\u0653\u0640\u0654\u064E\u062A\u064F\u0647\u064F\u06E5 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 82, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0646\u0650 \u0625\u0650\u062D\u06E1\u0633\u064E\u0627\u0646\u0657\u0627 \u0648\u064E\u0630\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u0650 \u0648\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u062D\u064F\u0633\u06E1\u0646\u0657\u0627 \u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 84, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u0641\u0650\u0643\u064F\u0648\u0646\u064E \u062F\u0650\u0645\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0642\u06E1\u0631\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 85, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u062A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0646\u064E \u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u0645\u0651\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u062A\u064E\u0638\u064E\u0670\u0647\u064E\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064F\u062F\u06E1\u0648\u064E\u0670\u0646\u0650 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0643\u064F\u0645\u06E1 \u0623\u064F\u0633\u064E\u0670\u0631\u064E\u0649\u0670 \u062A\u064F\u0641\u064E\u0670\u062F\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u062D\u064E\u0631\u0651\u064E\u0645\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u062E\u06E1\u0631\u064E\u0627\u062C\u064F\u0647\u064F\u0645\u06E1\u06DA \u0623\u064E\u0641\u064E\u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u0641\u064E\u0645\u064E\u0627 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0645\u064E\u0646 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u062E\u0650\u0632\u06E1\u064A\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u064A\u064F\u0631\u064E\u062F\u0651\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0634\u064E\u062F\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u063A\u064E\u0670\u0641\u0650\u0644\u064D \u0639\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 86, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0634\u06E1\u062A\u064E\u0631\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D6 \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u062E\u064E\u0641\u0651\u064E\u0641\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 87, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0642\u064E\u0641\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0628\u0650\u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u0650\u06D6 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064E \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0623\u064E\u064A\u0651\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u0650\u0631\u064F\u0648\u062D\u0650 \u0671\u0644\u06E1\u0642\u064F\u062F\u064F\u0633\u0650\u06D7 \u0623\u064E\u0641\u064E\u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0647\u06E1\u0648\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0643\u064F\u0645\u064F \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u0643\u064E\u0630\u0651\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 88, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0646\u064E\u0627 \u063A\u064F\u0644\u06E1\u0641\u064F\u06E2\u06DA \u0628\u064E\u0644 \u0644\u0651\u064E\u0639\u064E\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0641\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 89, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0643\u0650\u062A\u064E\u0670\u0628\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u065E \u0644\u0651\u0650\u0645\u064E\u0627 \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u064A\u064E\u0633\u06E1\u062A\u064E\u0641\u06E1\u062A\u0650\u062D\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0639\u064E\u0631\u064E\u0641\u064F\u0648\u0627\u0652 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u06DA \u0641\u064E\u0644\u064E\u0639\u06E1\u0646\u064E\u0629\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 90, text: "\u0628\u0650\u0626\u06E1\u0633\u064E\u0645\u064E\u0627 \u0671\u0634\u06E1\u062A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u063A\u06E1\u064A\u064B\u0627 \u0623\u064E\u0646 \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0628\u064E\u0627\u0653\u0621\u064F\u0648 \u0628\u0650\u063A\u064E\u0636\u064E\u0628\u064D \u0639\u064E\u0644\u064E\u0649\u0670 \u063A\u064E\u0636\u064E\u0628\u0656\u06DA \u0648\u064E\u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u065E" }, { id: 91, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0646\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0645\u064E\u0627 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u06E5 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0642\u064F\u0644\u06E1 \u0641\u064E\u0644\u0650\u0645\u064E \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u06E2\u0628\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 92, text: "\u06DE\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645 \u0645\u0651\u064F\u0648\u0633\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u062B\u064F\u0645\u0651\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u0650\u062C\u06E1\u0644\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0638\u064E\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 93, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0641\u064E\u0639\u06E1\u0646\u064E\u0627 \u0641\u064E\u0648\u06E1\u0642\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0637\u0651\u064F\u0648\u0631\u064E \u062E\u064F\u0630\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0628\u0650\u0642\u064F\u0648\u0651\u064E\u0629\u0656 \u0648\u064E\u0671\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0627\u0652\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0648\u064E\u0639\u064E\u0635\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0623\u064F\u0634\u06E1\u0631\u0650\u0628\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0639\u0650\u062C\u06E1\u0644\u064E \u0628\u0650\u0643\u064F\u0641\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1\u06DA \u0642\u064F\u0644\u06E1 \u0628\u0650\u0626\u06E1\u0633\u064E\u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 94, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064F \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062E\u064E\u0627\u0644\u0650\u0635\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0641\u064E\u062A\u064E\u0645\u064E\u0646\u0651\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 95, text: "\u0648\u064E\u0644\u064E\u0646 \u064A\u064E\u062A\u064E\u0645\u064E\u0646\u0651\u064E\u0648\u06E1\u0647\u064F \u0623\u064E\u0628\u064E\u062F\u064E\u06E2\u0627 \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 96, text: "\u0648\u064E\u0644\u064E\u062A\u064E\u062C\u0650\u062F\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062D\u06E1\u0631\u064E\u0635\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0639\u064E\u0644\u064E\u0649\u0670 \u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0656 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0627\u0652\u06DA \u064A\u064E\u0648\u064E\u062F\u0651\u064F \u0623\u064E\u062D\u064E\u062F\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0648\u06E1 \u064A\u064F\u0639\u064E\u0645\u0651\u064E\u0631\u064F \u0623\u064E\u0644\u06E1\u0641\u064E \u0633\u064E\u0646\u064E\u0629\u0656 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0628\u0650\u0645\u064F\u0632\u064E\u062D\u06E1\u0632\u0650\u062D\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0623\u064E\u0646 \u064A\u064F\u0639\u064E\u0645\u0651\u064E\u0631\u064E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u0635\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u062F\u064F\u0648\u0651\u0657\u0627 \u0644\u0651\u0650\u0640\u062C\u0650\u0628\u06E1\u0631\u0650\u064A\u0644\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0646\u064E\u0632\u0651\u064E\u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0644\u06E1\u0628\u0650\u0643\u064E \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 98, text: "\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u062F\u064F\u0648\u0651\u0657\u0627 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u062C\u0650\u0628\u06E1\u0631\u0650\u064A\u0644\u064E \u0648\u064E\u0645\u0650\u064A\u0643\u064E\u0649\u0670\u0644\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0644\u0651\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 99, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u06ED \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656\u06D6 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F \u0628\u0650\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 100, text: "\u0623\u064E\u0648\u064E\u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627 \u0639\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0639\u064E\u0647\u06E1\u062F\u0657\u0627 \u0646\u0651\u064E\u0628\u064E\u0630\u064E\u0647\u064F\u06E5 \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 101, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u065E \u0644\u0651\u0650\u0645\u064E\u0627 \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0628\u064E\u0630\u064E \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E \u0638\u064F\u0647\u064F\u0648\u0631\u0650\u0647\u0650\u0645\u06E1 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 102, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u062A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064F\u0644\u06E1\u0643\u0650 \u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0641\u064E\u0631\u064E \u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0671\u0644\u0633\u0651\u0650\u062D\u06E1\u0631\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0643\u064E\u064A\u06E1\u0646\u0650 \u0628\u0650\u0628\u064E\u0627\u0628\u0650\u0644\u064E \u0647\u064E\u0670\u0631\u064F\u0648\u062A\u064E \u0648\u064E\u0645\u064E\u0670\u0631\u064F\u0648\u062A\u064E\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064E\u0627\u0646\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u064D \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0642\u064F\u0648\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u065E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u06E1\u06D6 \u0641\u064E\u064A\u064E\u062A\u064E\u0639\u064E\u0644\u0651\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0645\u064E\u0627 \u064A\u064F\u0641\u064E\u0631\u0651\u0650\u0642\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u0621\u0650 \u0648\u064E\u0632\u064E\u0648\u06E1\u062C\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0628\u0650\u0636\u064E\u0627\u0653\u0631\u0651\u0650\u064A\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u064A\u064E\u062A\u064E\u0639\u064E\u0644\u0651\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u064F\u0648\u0627\u0652 \u0644\u064E\u0645\u064E\u0646\u0650 \u0671\u0634\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F \u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u064E\u0670\u0642\u0656\u06DA \u0648\u064E\u0644\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u0627 \u0634\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1\u06DA \u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 103, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0644\u064E\u0645\u064E\u062B\u064F\u0648\u0628\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E\u06DA \u0644\u0651\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 104, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0670\u0639\u0650\u0646\u064E\u0627 \u0648\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0671\u0646\u0638\u064F\u0631\u06E1\u0646\u064E\u0627 \u0648\u064E\u0671\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 105, text: "\u0645\u0651\u064E\u0627 \u064A\u064E\u0648\u064E\u062F\u0651\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0623\u064E\u0646 \u064A\u064F\u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062E\u06E1\u062A\u064E\u0635\u0651\u064F \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0630\u064F\u0648 \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 106, text: "\u06DE\u0645\u064E\u0627 \u0646\u064E\u0646\u0633\u064E\u062E\u06E1 \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u064D \u0623\u064E\u0648\u06E1 \u0646\u064F\u0646\u0633\u0650\u0647\u064E\u0627 \u0646\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u062E\u064E\u064A\u06E1\u0631\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0645\u0650\u062B\u06E1\u0644\u0650\u0647\u064E\u0627\u0653\u06D7 \u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 107, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u064D" }, { id: 108, text: "\u0623\u064E\u0645\u06E1 \u062A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u062A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0643\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627 \u0633\u064F\u0626\u0650\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0628\u064E\u062F\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u064E \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064E \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650" }, { id: 109, text: "\u0648\u064E\u062F\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0648\u06E1 \u064A\u064E\u0631\u064F\u062F\u0651\u064F\u0648\u0646\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1 \u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064B\u0627 \u062D\u064E\u0633\u064E\u062F\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06D6 \u0641\u064E\u0671\u0639\u06E1\u0641\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0635\u06E1\u0641\u064E\u062D\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6\u0653\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 110, text: "\u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0642\u064E\u062F\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u0644\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u062A\u064E\u062C\u0650\u062F\u064F\u0648\u0647\u064F \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 111, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0647\u064F\u0648\u062F\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0646\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670\u06D7 \u062A\u0650\u0644\u06E1\u0643\u064E \u0623\u064E\u0645\u064E\u0627\u0646\u0650\u064A\u0651\u064F\u0647\u064F\u0645\u06E1\u06D7 \u0642\u064F\u0644\u06E1 \u0647\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0628\u064F\u0631\u06E1\u0647\u064E\u0670\u0646\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 112, text: "\u0628\u064E\u0644\u064E\u0649\u0670\u06DA \u0645\u064E\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u064E \u0648\u064E\u062C\u06E1\u0647\u064E\u0647\u064F\u06E5 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u065E \u0641\u064E\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062C\u06E1\u0631\u064F\u0647\u064F\u06E5 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 113, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u064A\u064E\u0647\u064F\u0648\u062F\u064F \u0644\u064E\u064A\u06E1\u0633\u064E\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670 \u0644\u064E\u064A\u06E1\u0633\u064E\u062A\u0650 \u0671\u0644\u06E1\u064A\u064E\u0647\u064F\u0648\u062F\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E\u06D7 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u0650\u062B\u06E1\u0644\u064E \u0642\u064E\u0648\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0641\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0641\u0650\u064A\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 114, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646 \u0645\u0651\u064E\u0646\u064E\u0639\u064E \u0645\u064E\u0633\u064E\u0670\u062C\u0650\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646 \u064A\u064F\u0630\u06E1\u0643\u064E\u0631\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0671\u0633\u06E1\u0645\u064F\u0647\u064F\u06E5 \u0648\u064E\u0633\u064E\u0639\u064E\u0649\u0670 \u0641\u0650\u064A \u062E\u064E\u0631\u064E\u0627\u0628\u0650\u0647\u064E\u0627\u0653\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u062E\u064E\u0627\u0653\u0626\u0650\u0641\u0650\u064A\u0646\u064E\u06DA \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062E\u0650\u0632\u06E1\u064A\u065E \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 115, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0631\u0650\u0642\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0631\u0650\u0628\u064F\u06DA \u0641\u064E\u0623\u064E\u064A\u06E1\u0646\u064E\u0645\u064E\u0627 \u062A\u064F\u0648\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0641\u064E\u062B\u064E\u0645\u0651\u064E \u0648\u064E\u062C\u06E1\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0670\u0633\u0650\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 116, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u062F\u0657\u0627\u06D7 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5\u06D6 \u0628\u064E\u0644 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0643\u064F\u0644\u0651\u065E \u0644\u0651\u064E\u0647\u064F\u06E5 \u0642\u064E\u0670\u0646\u0650\u062A\u064F\u0648\u0646\u064E" }, { id: 117, text: "\u0628\u064E\u062F\u0650\u064A\u0639\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0636\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0631\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u064E\u0647\u064F\u06E5 \u0643\u064F\u0646 \u0641\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F" }, { id: 118, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u064A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064F\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0648\u06E1 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u065E\u06D7 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u062B\u06E1\u0644\u064E \u0642\u064E\u0648\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06D8 \u062A\u064E\u0634\u064E\u0670\u0628\u064E\u0647\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1\u06D7 \u0642\u064E\u062F\u06E1 \u0628\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 119, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0628\u064E\u0634\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0646\u064E\u0630\u0650\u064A\u0631\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F \u0639\u064E\u0646\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 120, text: "\u0648\u064E\u0644\u064E\u0646 \u062A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670 \u0639\u064E\u0646\u0643\u064E \u0671\u0644\u06E1\u064A\u064E\u0647\u064F\u0648\u062F\u064F \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064E \u0645\u0650\u0644\u0651\u064E\u062A\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0647\u064F\u062F\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670\u06D7 \u0648\u064E\u0644\u064E\u0626\u0650\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u06E1\u062A\u064E \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0628\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u0645\u064E\u0627 \u0644\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u064D" }, { id: 121, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u062D\u064E\u0642\u0651\u064E \u062A\u0650\u0644\u064E\u0627\u0648\u064E\u062A\u0650\u0647\u0650\u06E6\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 122, text: "\u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u062A\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0651\u0650\u064A \u0641\u064E\u0636\u0651\u064E\u0644\u06E1\u062A\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 123, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u064A\u064E\u0648\u06E1\u0645\u0657\u0627 \u0644\u0651\u064E\u0627 \u062A\u064E\u062C\u06E1\u0632\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u064C \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0656 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0642\u06E1\u0628\u064E\u0644\u064F \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0639\u064E\u062F\u06E1\u0644\u065E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u0641\u064E\u0639\u064F\u0647\u064E\u0627 \u0634\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 124, text: "\u06DE\u0648\u064E\u0625\u0650\u0630\u0650 \u0671\u0628\u06E1\u062A\u064E\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064E \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u06E5 \u0628\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0656 \u0641\u064E\u0623\u064E\u062A\u064E\u0645\u0651\u064E\u0647\u064F\u0646\u0651\u064E\u06D6 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u062C\u064E\u0627\u0639\u0650\u0644\u064F\u0643\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0625\u0650\u0645\u064E\u0627\u0645\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0648\u064E\u0645\u0650\u0646 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u0650\u064A\u06D6 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0627 \u064A\u064E\u0646\u064E\u0627\u0644\u064F \u0639\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 125, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u064E \u0645\u064E\u062B\u064E\u0627\u0628\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0623\u064E\u0645\u06E1\u0646\u0657\u0627 \u0648\u064E\u0671\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0645\u0651\u064E\u0642\u064E\u0627\u0645\u0650 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064E \u0645\u064F\u0635\u064E\u0644\u0651\u0657\u0649\u06D6 \u0648\u064E\u0639\u064E\u0647\u0650\u062F\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E \u0623\u064E\u0646 \u0637\u064E\u0647\u0651\u0650\u0631\u064E\u0627 \u0628\u064E\u064A\u06E1\u062A\u0650\u064A\u064E \u0644\u0650\u0644\u0637\u0651\u064E\u0627\u0653\u0626\u0650\u0641\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0670\u0643\u0650\u0641\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u0631\u0651\u064F\u0643\u0651\u064E\u0639\u0650 \u0671\u0644\u0633\u0651\u064F\u062C\u064F\u0648\u062F\u0650" }, { id: 126, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064F \u0631\u064E\u0628\u0651\u0650 \u0671\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u062F\u064B\u0627 \u0621\u064E\u0627\u0645\u0650\u0646\u0657\u0627 \u0648\u064E\u0671\u0631\u06E1\u0632\u064F\u0642\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u06DA \u0642\u064E\u0627\u0644\u064E \u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E \u0641\u064E\u0623\u064F\u0645\u064E\u062A\u0651\u0650\u0639\u064F\u0647\u064F\u06E5 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0636\u06E1\u0637\u064E\u0631\u0651\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 127, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u064A\u064E\u0631\u06E1\u0641\u064E\u0639\u064F \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u064E\u0627\u0639\u0650\u062F\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u0650 \u0648\u064E\u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064F \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u062A\u064E\u0642\u064E\u0628\u0651\u064E\u0644\u06E1 \u0645\u0650\u0646\u0651\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 128, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064E\u064A\u06E1\u0646\u0650 \u0644\u064E\u0643\u064E \u0648\u064E\u0645\u0650\u0646 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u0650\u0646\u064E\u0627\u0653 \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0645\u0651\u064F\u0633\u06E1\u0644\u0650\u0645\u064E\u0629\u0657 \u0644\u0651\u064E\u0643\u064E \u0648\u064E\u0623\u064E\u0631\u0650\u0646\u064E\u0627 \u0645\u064E\u0646\u064E\u0627\u0633\u0650\u0643\u064E\u0646\u064E\u0627 \u0648\u064E\u062A\u064F\u0628\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u0651\u064E\u0627\u0628\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 129, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u0628\u06E1\u0639\u064E\u062B\u06E1 \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0643\u064E \u0648\u064E\u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0648\u064E\u064A\u064F\u0632\u064E\u0643\u0651\u0650\u064A\u0647\u0650\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 130, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0631\u06E1\u063A\u064E\u0628\u064F \u0639\u064E\u0646 \u0645\u0651\u0650\u0644\u0651\u064E\u0629\u0650 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0633\u064E\u0641\u0650\u0647\u064E \u0646\u064E\u0641\u06E1\u0633\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u0650 \u0671\u0635\u06E1\u0637\u064E\u0641\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 131, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u06E5 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u0633\u06E1\u0644\u0650\u0645\u06E1\u06D6 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u06E1\u062A\u064F \u0644\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 132, text: "\u0648\u064E\u0648\u064E\u0635\u0651\u064E\u0649\u0670 \u0628\u0650\u0647\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064F \u0628\u064E\u0646\u0650\u064A\u0647\u0650 \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064F \u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0651\u064E \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0635\u06E1\u0637\u064E\u0641\u064E\u0649\u0670 \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u064F\u0648\u062A\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 133, text: "\u0623\u064E\u0645\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u0630\u06E1 \u062D\u064E\u0636\u064E\u0631\u064E \u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0628\u064E\u0646\u0650\u064A\u0647\u0650 \u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u064A\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0646\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0625\u0650\u0644\u064E\u0670\u0647\u064E\u0643\u064E \u0648\u064E\u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0643\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0625\u0650\u0644\u064E\u0670\u0647\u0657\u0627 \u0648\u064E\u0670\u062D\u0650\u062F\u0657\u0627 \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 134, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0623\u064F\u0645\u0651\u064E\u0629\u065E \u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1\u06D6 \u0644\u064E\u0647\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0648\u064E\u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 135, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0647\u064F\u0648\u062F\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0646\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670 \u062A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0627\u0652\u06D7 \u0642\u064F\u0644\u06E1 \u0628\u064E\u0644\u06E1 \u0645\u0650\u0644\u0651\u064E\u0629\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064E \u062D\u064E\u0646\u0650\u064A\u0641\u0657\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 136, text: "\u0642\u064F\u0648\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0628\u064E\u0627\u0637\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0639\u0650\u064A\u0633\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0627 \u0646\u064F\u0641\u064E\u0631\u0651\u0650\u0642\u064F \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 137, text: "\u0641\u064E\u0625\u0650\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u0650\u062B\u06E1\u0644\u0650 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u0642\u064E\u062F\u0650 \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0648\u0627\u0652\u06D6 \u0648\u0651\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0634\u0650\u0642\u064E\u0627\u0642\u0656\u06D6 \u0641\u064E\u0633\u064E\u064A\u064E\u0643\u06E1\u0641\u0650\u064A\u0643\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 138, text: "\u0635\u0650\u0628\u06E1\u063A\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0635\u0650\u0628\u06E1\u063A\u064E\u0629\u0657\u06D6 \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0670\u0628\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 139, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u062A\u064F\u062D\u064E\u0627\u0653\u062C\u0651\u064F\u0648\u0646\u064E\u0646\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u064F\u0648\u0646\u064E" }, { id: 140, text: "\u0623\u064E\u0645\u06E1 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0625\u0650\u0646\u0651\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0628\u064E\u0627\u0637\u064E \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0647\u064F\u0648\u062F\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0646\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670\u06D7 \u0642\u064F\u0644\u06E1 \u0621\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0623\u064E\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646 \u0643\u064E\u062A\u064E\u0645\u064E \u0634\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u064B \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u063A\u064E\u0670\u0641\u0650\u0644\u064D \u0639\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 141, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0623\u064F\u0645\u0651\u064E\u0629\u065E \u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1\u06D6 \u0644\u064E\u0647\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0648\u064E\u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 142, text: "\u06DE\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0633\u0651\u064F\u0641\u064E\u0647\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0627 \u0648\u064E\u0644\u0651\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0642\u0650\u0628\u06E1\u0644\u064E\u062A\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06DA \u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0631\u0650\u0642\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0631\u0650\u0628\u064F\u06DA \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 143, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0633\u064E\u0637\u0657\u0627 \u0644\u0651\u0650\u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0634\u064E\u0647\u0650\u064A\u062F\u0657\u0627\u06D7 \u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0642\u0650\u0628\u06E1\u0644\u064E\u0629\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064F\u0646\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0645\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0645\u0650\u0645\u0651\u064E\u0646 \u064A\u064E\u0646\u0642\u064E\u0644\u0650\u0628\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u0642\u0650\u0628\u064E\u064A\u06E1\u0647\u0650\u06DA \u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0644\u064E\u0643\u064E\u0628\u0650\u064A\u0631\u064E\u0629\u064B \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u062F\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064F\u0636\u0650\u064A\u0639\u064E \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064E\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0631\u064E\u0621\u064F\u0648\u0641\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 144, text: "\u0642\u064E\u062F\u06E1 \u0646\u064E\u0631\u064E\u0649\u0670 \u062A\u064E\u0642\u064E\u0644\u0651\u064F\u0628\u064E \u0648\u064E\u062C\u06E1\u0647\u0650\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650\u06D6 \u0641\u064E\u0644\u064E\u0646\u064F\u0648\u064E\u0644\u0651\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0642\u0650\u0628\u06E1\u0644\u064E\u0629\u0657 \u062A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670\u0647\u064E\u0627\u06DA \u0641\u064E\u0648\u064E\u0644\u0651\u0650 \u0648\u064E\u062C\u06E1\u0647\u064E\u0643\u064E \u0634\u064E\u0637\u06E1\u0631\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650\u06DA \u0648\u064E\u062D\u064E\u064A\u06E1\u062B\u064F \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u064E\u0648\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0643\u064F\u0645\u06E1 \u0634\u064E\u0637\u06E1\u0631\u064E\u0647\u064F\u06E5\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0644\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u063A\u064E\u0670\u0641\u0650\u0644\u064D \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 145, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u062A\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0621\u064E\u0627\u064A\u064E\u0629\u0656 \u0645\u0651\u064E\u0627 \u062A\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0642\u0650\u0628\u06E1\u0644\u064E\u062A\u064E\u0643\u064E\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0628\u0650\u062A\u064E\u0627\u0628\u0650\u0639\u0656 \u0642\u0650\u0628\u06E1\u0644\u064E\u062A\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645 \u0628\u0650\u062A\u064E\u0627\u0628\u0650\u0639\u0656 \u0642\u0650\u0628\u06E1\u0644\u064E\u0629\u064E \u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u0648\u064E\u0644\u064E\u0626\u0650\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u06E1\u062A\u064E \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 146, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u064A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0643\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u064E\u064A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 147, text: "\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0645\u06E1\u062A\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 148, text: "\u0648\u064E\u0644\u0650\u0643\u064F\u0644\u0651\u0656 \u0648\u0650\u062C\u06E1\u0647\u064E\u0629\u064C \u0647\u064F\u0648\u064E \u0645\u064F\u0648\u064E\u0644\u0651\u0650\u064A\u0647\u064E\u0627\u06D6 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0628\u0650\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064E\u0670\u062A\u0650\u06DA \u0623\u064E\u064A\u06E1\u0646\u064E \u0645\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 149, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u062E\u064E\u0631\u064E\u062C\u06E1\u062A\u064E \u0641\u064E\u0648\u064E\u0644\u0651\u0650 \u0648\u064E\u062C\u06E1\u0647\u064E\u0643\u064E \u0634\u064E\u0637\u06E1\u0631\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u063A\u064E\u0670\u0641\u0650\u0644\u064D \u0639\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 150, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u062E\u064E\u0631\u064E\u062C\u06E1\u062A\u064E \u0641\u064E\u0648\u064E\u0644\u0651\u0650 \u0648\u064E\u062C\u06E1\u0647\u064E\u0643\u064E \u0634\u064E\u0637\u06E1\u0631\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650\u06DA \u0648\u064E\u062D\u064E\u064A\u06E1\u062B\u064F \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u064E\u0648\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0643\u064F\u0645\u06E1 \u0634\u064E\u0637\u06E1\u0631\u064E\u0647\u064F\u06E5 \u0644\u0650\u0626\u064E\u0644\u0651\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062D\u064F\u062C\u0651\u064E\u0629\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u0650\u064A \u0648\u064E\u0644\u0650\u0623\u064F\u062A\u0650\u0645\u0651\u064E \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u0650\u064A \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 151, text: "\u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u064A\u064F\u0632\u064E\u0643\u0651\u0650\u064A\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0648\u064E\u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 152, text: "\u0641\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u0650\u064A\u0653 \u0623\u064E\u0630\u06E1\u0643\u064F\u0631\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u064A \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u0650" }, { id: 153, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0633\u06E1\u062A\u064E\u0639\u0650\u064A\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0635\u0651\u064E\u0628\u06E1\u0631\u0650 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 154, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0645\u064E\u0646 \u064A\u064F\u0642\u06E1\u062A\u064E\u0644\u064F \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u062A\u064F\u06E2\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u062D\u06E1\u064A\u064E\u0627\u0653\u0621\u065E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u064E\u0627 \u062A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 155, text: "\u0648\u064E\u0644\u064E\u0646\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0646\u0651\u064E\u0643\u064F\u0645 \u0628\u0650\u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0648\u06E1\u0641\u0650 \u0648\u064E\u0671\u0644\u06E1\u062C\u064F\u0648\u0639\u0650 \u0648\u064E\u0646\u064E\u0642\u06E1\u0635\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u0641\u064F\u0633\u0650 \u0648\u064E\u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650\u06D7 \u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 156, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0670\u0628\u064E\u062A\u06E1\u0647\u064F\u0645 \u0645\u0651\u064F\u0635\u0650\u064A\u0628\u064E\u0629\u065E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0631\u064E\u0670\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 157, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0635\u064E\u0644\u064E\u0648\u064E\u0670\u062A\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 158, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0635\u0651\u064E\u0641\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u0648\u064E\u0629\u064E \u0645\u0650\u0646 \u0634\u064E\u0639\u064E\u0627\u0653\u0626\u0650\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0641\u064E\u0645\u064E\u0646\u06E1 \u062D\u064E\u062C\u0651\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u064E \u0623\u064E\u0648\u0650 \u0671\u0639\u06E1\u062A\u064E\u0645\u064E\u0631\u064E \u0641\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0646 \u064A\u064E\u0637\u0651\u064E\u0648\u0651\u064E\u0641\u064E \u0628\u0650\u0647\u0650\u0645\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0646 \u062A\u064E\u0637\u064E\u0648\u0651\u064E\u0639\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u0627\u0643\u0650\u0631\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 159, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u0628\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0640\u0670\u0647\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064E\u0644\u06E1\u0639\u064E\u0646\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u064A\u064E\u0644\u06E1\u0639\u064E\u0646\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0640\u0670\u0639\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 160, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064F\u0648\u0627\u0652 \u0648\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u062A\u064F\u0648\u0628\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u064E\u0627 \u0671\u0644\u062A\u0651\u064E\u0648\u0651\u064E\u0627\u0628\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 161, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064C \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0644\u064E\u0639\u06E1\u0646\u064E\u0629\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 162, text: "\u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064E\u0627 \u064A\u064F\u062E\u064E\u0641\u0651\u064E\u0641\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0638\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 163, text: "\u0648\u064E\u0625\u0650\u0644\u064E\u0670\u0647\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E\u06D6 \u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 164, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u062E\u064E\u0644\u06E1\u0642\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u062E\u06E1\u062A\u0650\u0644\u064E\u0670\u0641\u0650 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u0650\u0646 \u0645\u0651\u064E\u0627\u0653\u0621\u0656 \u0641\u064E\u0623\u064E\u062D\u06E1\u064A\u064E\u0627 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627 \u0648\u064E\u0628\u064E\u062B\u0651\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0656 \u0648\u064E\u062A\u064E\u0635\u06E1\u0631\u0650\u064A\u0641\u0650 \u0671\u0644\u0631\u0651\u0650\u064A\u064E\u0670\u062D\u0650 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0627\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0633\u064E\u062E\u0651\u064E\u0631\u0650 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 165, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646\u062F\u064E\u0627\u062F\u0657\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u062D\u064F\u0628\u0651\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u062D\u064F\u0628\u0651\u0657\u0627 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0644\u064E\u0648\u06E1 \u064A\u064E\u0631\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0642\u064F\u0648\u0651\u064E\u0629\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650" }, { id: 166, text: "\u0625\u0650\u0630\u06E1 \u062A\u064E\u0628\u064E\u0631\u0651\u064E\u0623\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064F\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0648\u064E\u0631\u064E\u0623\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0648\u064E\u062A\u064E\u0642\u064E\u0637\u0651\u064E\u0639\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0628\u064E\u0627\u0628\u064F" }, { id: 167, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0646\u064E\u0627 \u0643\u064E\u0631\u0651\u064E\u0629\u0657 \u0641\u064E\u0646\u064E\u062A\u064E\u0628\u064E\u0631\u0651\u064E\u0623\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627 \u062A\u064E\u0628\u064E\u0631\u0651\u064E\u0621\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u0651\u064E\u0627\u06D7 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0631\u0650\u064A\u0647\u0650\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u0633\u064E\u0631\u064E\u0670\u062A\u064D \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0628\u0650\u062E\u064E\u0670\u0631\u0650\u062C\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 168, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062D\u064E\u0644\u064E\u0670\u0644\u0657\u0627 \u0637\u064E\u064A\u0651\u0650\u0628\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u062E\u064F\u0637\u064F\u0648\u064E\u0670\u062A\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 169, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0641\u064E\u062D\u06E1\u0634\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 170, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u06E1 \u0646\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0645\u064E\u0627\u0653 \u0623\u064E\u0644\u06E1\u0641\u064E\u064A\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627\u0653\u06DA \u0623\u064E\u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 171, text: "\u0648\u064E\u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0646\u06E1\u0639\u0650\u0642\u064F \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u062F\u064F\u0639\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u0646\u0650\u062F\u064E\u0627\u0653\u0621\u0657\u06DA \u0635\u064F\u0645\u0651\u064F\u06E2 \u0628\u064F\u0643\u06E1\u0645\u064C \u0639\u064F\u0645\u06E1\u064A\u065E \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 172, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0645\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u064A\u0651\u064E\u0627\u0647\u064F \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 173, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u062A\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u062F\u0651\u064E\u0645\u064E \u0648\u064E\u0644\u064E\u062D\u06E1\u0645\u064E \u0671\u0644\u06E1\u062E\u0650\u0646\u0632\u0650\u064A\u0631\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0647\u0650\u0644\u0651\u064E \u0628\u0650\u0647\u0650\u06E6 \u0644\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0636\u06E1\u0637\u064F\u0631\u0651\u064E \u063A\u064E\u064A\u06E1\u0631\u064E \u0628\u064E\u0627\u063A\u0656 \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0627\u062F\u0656 \u0641\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u062B\u06E1\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 174, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u064A\u064E\u0634\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u062B\u064E\u0645\u064E\u0646\u0657\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0628\u064F\u0637\u064F\u0648\u0646\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0632\u064E\u0643\u0651\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 175, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0634\u06E1\u062A\u064E\u0631\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0636\u0651\u064E\u0644\u064E\u0670\u0644\u064E\u0629\u064E \u0628\u0650\u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0650\u06DA \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u0628\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 176, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0641\u0650\u064A \u0634\u0650\u0642\u064E\u0627\u0642\u0650\u06ED \u0628\u064E\u0639\u0650\u064A\u062F\u0656" }, { id: 177, text: "\u06DE\u0644\u0651\u064E\u064A\u06E1\u0633\u064E \u0671\u0644\u06E1\u0628\u0650\u0631\u0651\u064E \u0623\u064E\u0646 \u062A\u064F\u0648\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0643\u064F\u0645\u06E1 \u0642\u0650\u0628\u064E\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0631\u0650\u0642\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0631\u0650\u0628\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0628\u0650\u0631\u0651\u064E \u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0627\u0644\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u062D\u064F\u0628\u0651\u0650\u0647\u0650\u06E6 \u0630\u064E\u0648\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0628\u06E1\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0627\u0653\u0626\u0650\u0644\u0650\u064A\u0646\u064E \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u0631\u0651\u0650\u0642\u064E\u0627\u0628\u0650 \u0648\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0649 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0648\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0639\u064E\u0647\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0639\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u0623\u06E1\u0633\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u0636\u0651\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u062D\u0650\u064A\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u0623\u06E1\u0633\u0650\u06D7 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0635\u064E\u062F\u064E\u0642\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 178, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0643\u064F\u062A\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0642\u0650\u0635\u064E\u0627\u0635\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u062A\u06E1\u0644\u064E\u0649\u06D6 \u0671\u0644\u06E1\u062D\u064F\u0631\u0651\u064F \u0628\u0650\u0671\u0644\u06E1\u062D\u064F\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0628\u06E1\u062F\u064F \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0628\u06E1\u062F\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u0649\u0670\u06DA \u0641\u064E\u0645\u064E\u0646\u06E1 \u0639\u064F\u0641\u0650\u064A\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u0634\u064E\u064A\u06E1\u0621\u065E \u0641\u064E\u0671\u062A\u0651\u0650\u0628\u064E\u0627\u0639\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0648\u064E\u0623\u064E\u062F\u064E\u0627\u0653\u0621\u064C \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0628\u0650\u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u0656\u06D7 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062A\u064E\u062E\u06E1\u0641\u0650\u064A\u0641\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E\u06D7 \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0639\u06E1\u062A\u064E\u062F\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 179, text: "\u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0642\u0650\u0635\u064E\u0627\u0635\u0650 \u062D\u064E\u064A\u064E\u0648\u0670\u0629\u065E \u064A\u064E\u0640\u0670\u0653\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 180, text: "\u0643\u064F\u062A\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u062D\u064E\u0636\u064E\u0631\u064E \u0623\u064E\u062D\u064E\u062F\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u0625\u0650\u0646 \u062A\u064E\u0631\u064E\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u064B\u0627 \u0671\u0644\u06E1\u0648\u064E\u0635\u0650\u064A\u0651\u064E\u0629\u064F \u0644\u0650\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u0650\u064A\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650\u06D6 \u062D\u064E\u0642\u0651\u064B\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 181, text: "\u0641\u064E\u0645\u064E\u0646\u06E2 \u0628\u064E\u062F\u0651\u064E\u0644\u064E\u0647\u064F\u06E5 \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u064E\u0647\u064F\u06E5 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0625\u0650\u062B\u06E1\u0645\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064F\u0648\u0646\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 182, text: "\u0641\u064E\u0645\u064E\u0646\u06E1 \u062E\u064E\u0627\u0641\u064E \u0645\u0650\u0646 \u0645\u0651\u064F\u0648\u0635\u0656 \u062C\u064E\u0646\u064E\u0641\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0625\u0650\u062B\u06E1\u0645\u0657\u0627 \u0641\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u062B\u06E1\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 183, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0643\u064F\u062A\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u0650\u064A\u064E\u0627\u0645\u064F \u0643\u064E\u0645\u064E\u0627 \u0643\u064F\u062A\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 184, text: "\u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0657\u0627 \u0645\u0651\u064E\u0639\u06E1\u062F\u064F\u0648\u062F\u064E\u0670\u062A\u0656\u06DA \u0641\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0631\u0650\u064A\u0636\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064E\u0641\u064E\u0631\u0656 \u0641\u064E\u0639\u0650\u062F\u0651\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u064D \u0623\u064F\u062E\u064E\u0631\u064E\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0637\u0650\u064A\u0642\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0641\u0650\u062F\u06E1\u064A\u064E\u0629\u065E \u0637\u064E\u0639\u064E\u0627\u0645\u064F \u0645\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u0656\u06D6 \u0641\u064E\u0645\u064E\u0646 \u062A\u064E\u0637\u064E\u0648\u0651\u064E\u0639\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0641\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0623\u064E\u0646 \u062A\u064E\u0635\u064F\u0648\u0645\u064F\u0648\u0627\u0652 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 185, text: "\u0634\u064E\u0647\u06E1\u0631\u064F \u0631\u064E\u0645\u064E\u0636\u064E\u0627\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0641\u0650\u064A\u0647\u0650 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064F \u0647\u064F\u062F\u0657\u0649 \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0641\u064F\u0631\u06E1\u0642\u064E\u0627\u0646\u0650\u06DA \u0641\u064E\u0645\u064E\u0646 \u0634\u064E\u0647\u0650\u062F\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u0647\u06E1\u0631\u064E \u0641\u064E\u0644\u06E1\u064A\u064E\u0635\u064F\u0645\u06E1\u0647\u064F\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u0631\u0650\u064A\u0636\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064E\u0641\u064E\u0631\u0656 \u0641\u064E\u0639\u0650\u062F\u0651\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u064D \u0623\u064F\u062E\u064E\u0631\u064E\u06D7 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u064A\u064F\u0633\u06E1\u0631\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0628\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064F\u0633\u06E1\u0631\u064E \u0648\u064E\u0644\u0650\u062A\u064F\u0643\u06E1\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u062F\u0651\u064E\u0629\u064E \u0648\u064E\u0644\u0650\u062A\u064F\u0643\u064E\u0628\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0647\u064E\u062F\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 186, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u0623\u064E\u0644\u064E\u0643\u064E \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A \u0639\u064E\u0646\u0651\u0650\u064A \u0641\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0642\u064E\u0631\u0650\u064A\u0628\u064C\u06D6 \u0623\u064F\u062C\u0650\u064A\u0628\u064F \u062F\u064E\u0639\u06E1\u0648\u064E\u0629\u064E \u0671\u0644\u062F\u0651\u064E\u0627\u0639\u0650 \u0625\u0650\u0630\u064E\u0627 \u062F\u064E\u0639\u064E\u0627\u0646\u0650\u06D6 \u0641\u064E\u0644\u06E1\u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u0644\u0650\u064A \u0648\u064E\u0644\u06E1\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u064A \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u0634\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 187, text: "\u0623\u064F\u062D\u0650\u0644\u0651\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u064A\u06E1\u0644\u064E\u0629\u064E \u0671\u0644\u0635\u0651\u0650\u064A\u064E\u0627\u0645\u0650 \u0671\u0644\u0631\u0651\u064E\u0641\u064E\u062B\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0646\u0650\u0633\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u06E1\u06DA \u0647\u064F\u0646\u0651\u064E \u0644\u0650\u0628\u064E\u0627\u0633\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u0650\u0628\u064E\u0627\u0633\u065E \u0644\u0651\u064E\u0647\u064F\u0646\u0651\u064E\u06D7 \u0639\u064E\u0644\u0650\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u062E\u06E1\u062A\u064E\u0627\u0646\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u062A\u064E\u0627\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0639\u064E\u0641\u064E\u0627 \u0639\u064E\u0646\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0671\u0644\u06E1\u0640\u0654\u064E\u0670\u0646\u064E \u0628\u064E\u0670\u0634\u0650\u0631\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0671\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0643\u064E\u062A\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0634\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0637\u064F \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u064A\u064E\u0636\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0637\u0650 \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0648\u064E\u062F\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0641\u064E\u062C\u06E1\u0631\u0650\u06D6 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062A\u0650\u0645\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u0650\u064A\u064E\u0627\u0645\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0628\u064E\u0670\u0634\u0650\u0631\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0670\u0643\u0650\u0641\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u062C\u0650\u062F\u0650\u06D7 \u062A\u0650\u0644\u06E1\u0643\u064E \u062D\u064F\u062F\u064F\u0648\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0647\u064E\u0627\u06D7 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 188, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0643\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u0648\u064E\u062A\u064F\u062F\u06E1\u0644\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062D\u064F\u0643\u0651\u064E\u0627\u0645\u0650 \u0644\u0650\u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 189, text: "\u06DE\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0623\u064E\u0647\u0650\u0644\u0651\u064E\u0629\u0650\u06D6 \u0642\u064F\u0644\u06E1 \u0647\u0650\u064A\u064E \u0645\u064E\u0648\u064E\u0670\u0642\u0650\u064A\u062A\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u062C\u0651\u0650\u06D7 \u0648\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0671\u0644\u06E1\u0628\u0650\u0631\u0651\u064F \u0628\u0650\u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0628\u064F\u064A\u064F\u0648\u062A\u064E \u0645\u0650\u0646 \u0638\u064F\u0647\u064F\u0648\u0631\u0650\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0628\u0650\u0631\u0651\u064E \u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0642\u064E\u0649\u0670\u06D7 \u0648\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0628\u064F\u064A\u064F\u0648\u062A\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u0650\u0647\u064E\u0627\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 190, text: "\u0648\u064E\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062A\u064E\u062F\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0639\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 191, text: "\u0648\u064E\u0671\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0647\u064F\u0645\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u062B\u064E\u0642\u0650\u0641\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064F\u0648\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u06E1\u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u064F \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u062A\u06E1\u0644\u0650\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650\u06D6 \u0641\u064E\u0625\u0650\u0646 \u0642\u064E\u0670\u062A\u064E\u0644\u064F\u0648\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0647\u064F\u0645\u06E1\u06D7 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 192, text: "\u0641\u064E\u0625\u0650\u0646\u0650 \u0671\u0646\u062A\u064E\u0647\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 193, text: "\u0648\u064E\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u065E \u0648\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06D6 \u0641\u064E\u0625\u0650\u0646\u0650 \u0671\u0646\u062A\u064E\u0647\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0644\u064E\u0627 \u0639\u064F\u062F\u06E1\u0648\u064E\u0670\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 194, text: "\u0671\u0644\u0634\u0651\u064E\u0647\u06E1\u0631\u064F \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u064F \u0628\u0650\u0671\u0644\u0634\u0651\u064E\u0647\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u062D\u064F\u0631\u064F\u0645\u064E\u0670\u062A\u064F \u0642\u0650\u0635\u064E\u0627\u0635\u065E\u06DA \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0639\u06E1\u062A\u064E\u062F\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0639\u06E1\u062A\u064E\u062F\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0628\u0650\u0645\u0650\u062B\u06E1\u0644\u0650 \u0645\u064E\u0627 \u0671\u0639\u06E1\u062A\u064E\u062F\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 195, text: "\u0648\u064E\u0623\u064E\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0644\u06E1\u0642\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u062A\u0651\u064E\u0647\u06E1\u0644\u064F\u0643\u064E\u0629\u0650 \u0648\u064E\u0623\u064E\u062D\u06E1\u0633\u0650\u0646\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 196, text: "\u0648\u064E\u0623\u064E\u062A\u0650\u0645\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u062C\u0651\u064E \u0648\u064E\u0671\u0644\u06E1\u0639\u064F\u0645\u06E1\u0631\u064E\u0629\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064F\u062D\u06E1\u0635\u0650\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u064A\u06E1\u0633\u064E\u0631\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0647\u064E\u062F\u06E1\u064A\u0650\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0644\u0650\u0642\u064F\u0648\u0627\u0652 \u0631\u064F\u0621\u064F\u0648\u0633\u064E\u0643\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0628\u06E1\u0644\u064F\u063A\u064E \u0671\u0644\u06E1\u0647\u064E\u062F\u06E1\u064A\u064F \u0645\u064E\u062D\u0650\u0644\u0651\u064E\u0647\u064F\u06E5\u06DA \u0641\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0631\u0650\u064A\u0636\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0630\u0657\u0649 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0623\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0641\u064E\u0641\u0650\u062F\u06E1\u064A\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0635\u0650\u064A\u064E\u0627\u0645\u064D \u0623\u064E\u0648\u06E1 \u0635\u064E\u062F\u064E\u0642\u064E\u0629\u064D \u0623\u064E\u0648\u06E1 \u0646\u064F\u0633\u064F\u0643\u0656\u06DA \u0641\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0645\u0650\u0646\u062A\u064F\u0645\u06E1 \u0641\u064E\u0645\u064E\u0646 \u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u064E \u0628\u0650\u0671\u0644\u06E1\u0639\u064F\u0645\u06E1\u0631\u064E\u0629\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062D\u064E\u062C\u0651\u0650 \u0641\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u064A\u06E1\u0633\u064E\u0631\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0647\u064E\u062F\u06E1\u064A\u0650\u06DA \u0641\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062C\u0650\u062F\u06E1 \u0641\u064E\u0635\u0650\u064A\u064E\u0627\u0645\u064F \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u062C\u0651\u0650 \u0648\u064E\u0633\u064E\u0628\u06E1\u0639\u064E\u0629\u064D \u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u062C\u064E\u0639\u06E1\u062A\u064F\u0645\u06E1\u06D7 \u062A\u0650\u0644\u06E1\u0643\u064E \u0639\u064E\u0634\u064E\u0631\u064E\u0629\u065E \u0643\u064E\u0627\u0645\u0650\u0644\u064E\u0629\u065E\u06D7 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064F\u0647\u064F\u06E5 \u062D\u064E\u0627\u0636\u0650\u0631\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 197, text: "\u0671\u0644\u06E1\u062D\u064E\u062C\u0651\u064F \u0623\u064E\u0634\u06E1\u0647\u064F\u0631\u065E \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u064E\u0670\u062A\u065E\u06DA \u0641\u064E\u0645\u064E\u0646 \u0641\u064E\u0631\u064E\u0636\u064E \u0641\u0650\u064A\u0647\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u062D\u064E\u062C\u0651\u064E \u0641\u064E\u0644\u064E\u0627 \u0631\u064E\u0641\u064E\u062B\u064E \u0648\u064E\u0644\u064E\u0627 \u0641\u064F\u0633\u064F\u0648\u0642\u064E \u0648\u064E\u0644\u064E\u0627 \u062C\u0650\u062F\u064E\u0627\u0644\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u062C\u0651\u0650\u06D7 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u06E1\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0648\u064E\u062A\u064E\u0632\u064E\u0648\u0651\u064E\u062F\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u062E\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0632\u0651\u064E\u0627\u062F\u0650 \u0671\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u0650 \u064A\u064E\u0640\u0670\u0653\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 198, text: "\u0644\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062C\u064F\u0646\u064E\u0627\u062D\u064C \u0623\u064E\u0646 \u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0641\u064E\u0636\u06E1\u0644\u0657\u0627 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06DA \u0641\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0641\u064E\u0636\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0631\u064E\u0641\u064E\u0670\u062A\u0656 \u0641\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0639\u064E\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650\u06D6 \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0647\u064F \u0643\u064E\u0645\u064E\u0627 \u0647\u064E\u062F\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0636\u0651\u064E\u0627\u0653\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 199, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0641\u0650\u064A\u0636\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0623\u064E\u0641\u064E\u0627\u0636\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 200, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0636\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0646\u064E\u0670\u0633\u0650\u0643\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0630\u0650\u0643\u06E1\u0631\u0650\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0634\u064E\u062F\u0651\u064E \u0630\u0650\u0643\u06E1\u0631\u0657\u0627\u06D7 \u0641\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u0650\u0646\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u064E\u0670\u0642\u0656" }, { id: 201, text: "\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u0650\u0646\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0657 \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0657 \u0648\u064E\u0642\u0650\u0646\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 202, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0635\u0650\u064A\u0628\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0631\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 203, text: "\u06DE\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u0645\u0651\u064E\u0639\u06E1\u062F\u064F\u0648\u062F\u064E\u0670\u062A\u0656\u06DA \u0641\u064E\u0645\u064E\u0646 \u062A\u064E\u0639\u064E\u062C\u0651\u064E\u0644\u064E \u0641\u0650\u064A \u064A\u064E\u0648\u06E1\u0645\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u062B\u06E1\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0645\u064E\u0646 \u062A\u064E\u0623\u064E\u062E\u0651\u064E\u0631\u064E \u0641\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u062B\u06E1\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06D6 \u0644\u0650\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0642\u064E\u0649\u0670\u06D7 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 204, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064F\u0639\u06E1\u062C\u0650\u0628\u064F\u0643\u064E \u0642\u064E\u0648\u06E1\u0644\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u064A\u064F\u0634\u06E1\u0647\u0650\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0641\u0650\u064A \u0642\u064E\u0644\u06E1\u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0644\u064E\u062F\u0651\u064F \u0671\u0644\u06E1\u062E\u0650\u0635\u064E\u0627\u0645\u0650" }, { id: 205, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0633\u064E\u0639\u064E\u0649\u0670 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0644\u0650\u064A\u064F\u0641\u06E1\u0633\u0650\u062F\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u064A\u064F\u0647\u06E1\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u06E1\u062B\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0633\u06E1\u0644\u064E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0641\u064E\u0633\u064E\u0627\u062F\u064E" }, { id: 206, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F \u0671\u062A\u0651\u064E\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F \u0671\u0644\u06E1\u0639\u0650\u0632\u0651\u064E\u0629\u064F \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650\u06DA \u0641\u064E\u062D\u064E\u0633\u06E1\u0628\u064F\u0647\u064F\u06E5 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F\u06D6 \u0648\u064E\u0644\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u0650\u0647\u064E\u0627\u062F\u064F" }, { id: 207, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064E\u0634\u06E1\u0631\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u064E\u0647\u064F \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0631\u06E1\u0636\u064E\u0627\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0621\u064F\u0648\u0641\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0639\u0650\u0628\u064E\u0627\u062F\u0650" }, { id: 208, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u0650\u0644\u06E1\u0645\u0650 \u0643\u064E\u0627\u0653\u0641\u0651\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u062E\u064F\u0637\u064F\u0648\u064E\u0670\u062A\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 209, text: "\u0641\u064E\u0625\u0650\u0646 \u0632\u064E\u0644\u064E\u0644\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u064F \u0641\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u064C" }, { id: 210, text: "\u0647\u064E\u0644\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A \u0638\u064F\u0644\u064E\u0644\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0645\u064E\u0627\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0648\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F\u06DA \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u064F" }, { id: 211, text: "\u0633\u064E\u0644\u06E1 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0643\u064E\u0645\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u0650\u06ED \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u06E1 \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 212, text: "\u0632\u064F\u064A\u0651\u0650\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u064A\u064E\u0633\u06E1\u062E\u064E\u0631\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652\u06D8 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0648\u06E1\u0642\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u0650\u0633\u064E\u0627\u0628\u0656" }, { id: 213, text: "\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0641\u064E\u0628\u064E\u0639\u064E\u062B\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0645\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0645\u064F\u0646\u0630\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u0650\u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0641\u0650\u064A\u0645\u064E\u0627 \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064E \u0641\u0650\u064A\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0647\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u064F \u0628\u064E\u063A\u06E1\u064A\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0647\u064E\u062F\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u0645\u064E\u0627 \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u064D" }, { id: 214, text: "\u0623\u064E\u0645\u06E1 \u062D\u064E\u0633\u0650\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0644\u064E\u0648\u06E1\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06D6 \u0645\u0651\u064E\u0633\u0651\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u0623\u06E1\u0633\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0671\u0644\u0636\u0651\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0632\u064F\u0644\u06E1\u0632\u0650\u0644\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0642\u064F\u0648\u0644\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0645\u064E\u062A\u064E\u0649\u0670 \u0646\u064E\u0635\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0646\u064E\u0635\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0642\u064E\u0631\u0650\u064A\u0628\u065E" }, { id: 215, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0645\u064E\u0627\u0630\u064E\u0627 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E\u06D6 \u0642\u064F\u0644\u06E1 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u0641\u064E\u0644\u0650\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u0650 \u0648\u064E\u0671\u0628\u06E1\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650\u06D7 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 216, text: "\u0643\u064F\u062A\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0642\u0650\u062A\u064E\u0627\u0644\u064F \u0648\u064E\u0647\u064F\u0648\u064E \u0643\u064F\u0631\u06E1\u0647\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064E\u0643\u06E1\u0631\u064E\u0647\u064F\u0648\u0627\u0652 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0627\u0652 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0647\u064F\u0648\u064E \u0634\u064E\u0631\u0651\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 217, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u0634\u0651\u064E\u0647\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650 \u0642\u0650\u062A\u064E\u0627\u0644\u0656 \u0641\u0650\u064A\u0647\u0650\u06D6 \u0642\u064F\u0644\u06E1 \u0642\u0650\u062A\u064E\u0627\u0644\u065E \u0641\u0650\u064A\u0647\u0650 \u0643\u064E\u0628\u0650\u064A\u0631\u065E\u06DA \u0648\u064E\u0635\u064E\u062F\u0651\u064C \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u064F\u0641\u06E1\u0631\u064F\u06E2 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650 \u0648\u064E\u0625\u0650\u062E\u06E1\u0631\u064E\u0627\u062C\u064F \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1\u0647\u064F \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0671\u0644\u06E1\u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u064F \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u062A\u06E1\u0644\u0650\u06D7 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0632\u064E\u0627\u0644\u064F\u0648\u0646\u064E \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0631\u064F\u062F\u0651\u064F\u0648\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646 \u062F\u0650\u064A\u0646\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0670\u0639\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0631\u06E1\u062A\u064E\u062F\u0650\u062F\u06E1 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646 \u062F\u0650\u064A\u0646\u0650\u0647\u0650\u06E6 \u0641\u064E\u064A\u064E\u0645\u064F\u062A\u06E1 \u0648\u064E\u0647\u064F\u0648\u064E \u0643\u064E\u0627\u0641\u0650\u0631\u065E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u062D\u064E\u0628\u0650\u0637\u064E\u062A\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 218, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062C\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 219, text: "\u06DE\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u062E\u064E\u0645\u06E1\u0631\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u0633\u0650\u0631\u0650\u06D6 \u0642\u064F\u0644\u06E1 \u0641\u0650\u064A\u0647\u0650\u0645\u064E\u0627\u0653 \u0625\u0650\u062B\u06E1\u0645\u065E \u0643\u064E\u0628\u0650\u064A\u0631\u065E \u0648\u064E\u0645\u064E\u0646\u064E\u0670\u0641\u0650\u0639\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0625\u0650\u062B\u06E1\u0645\u064F\u0647\u064F\u0645\u064E\u0627\u0653 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u0645\u0650\u0646 \u0646\u0651\u064E\u0641\u06E1\u0639\u0650\u0647\u0650\u0645\u064E\u0627\u06D7 \u0648\u064E\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0645\u064E\u0627\u0630\u064E\u0627 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E\u06D6 \u0642\u064F\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0641\u06E1\u0648\u064E\u06D7 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 220, text: "\u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D7 \u0648\u064E\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670\u06D6 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0635\u06E1\u0644\u064E\u0627\u062D\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u065E\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u062E\u064E\u0627\u0644\u0650\u0637\u064F\u0648\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0635\u06E1\u0644\u0650\u062D\u0650\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0623\u064E\u0639\u06E1\u0646\u064E\u062A\u064E\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 221, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u0643\u0650\u062D\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u064E\u0670\u062A\u0650 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u0651\u064E\u06DA \u0648\u064E\u0644\u064E\u0623\u064E\u0645\u064E\u0629\u065E \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0629\u064C \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646 \u0645\u0651\u064F\u0634\u06E1\u0631\u0650\u0643\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0639\u06E1\u062C\u064E\u0628\u064E\u062A\u06E1\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0646\u0643\u0650\u062D\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0644\u064E\u0639\u064E\u0628\u06E1\u062F\u065E \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064C \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646 \u0645\u0651\u064F\u0634\u06E1\u0631\u0650\u0643\u0656 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0639\u06E1\u062C\u064E\u0628\u064E\u0643\u064F\u0645\u06E1\u06D7 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0650 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 222, text: "\u0648\u064E\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064E\u062D\u0650\u064A\u0636\u0650\u06D6 \u0642\u064F\u0644\u06E1 \u0647\u064F\u0648\u064E \u0623\u064E\u0630\u0657\u0649 \u0641\u064E\u0671\u0639\u06E1\u062A\u064E\u0632\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062D\u0650\u064A\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0637\u06E1\u0647\u064F\u0631\u06E1\u0646\u064E\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u0637\u064E\u0647\u0651\u064E\u0631\u06E1\u0646\u064E \u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0623\u064E\u0645\u064E\u0631\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u062A\u0651\u064E\u0648\u0651\u064E\u0640\u0670\u0628\u0650\u064A\u0646\u064E \u0648\u064E\u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0637\u064E\u0647\u0651\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 223, text: "\u0646\u0650\u0633\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1 \u062D\u064E\u0631\u06E1\u062B\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u062D\u064E\u0631\u06E1\u062B\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u0634\u0650\u0626\u06E1\u062A\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0642\u064E\u062F\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u0644\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u064F\u0644\u064E\u0670\u0642\u064F\u0648\u0647\u064F\u06D7 \u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 224, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064F\u0631\u06E1\u0636\u064E\u0629\u0657 \u0644\u0651\u0650\u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0628\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064F\u0635\u06E1\u0644\u0650\u062D\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 225, text: "\u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u064E\u0627\u062E\u0650\u0630\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u063A\u06E1\u0648\u0650 \u0641\u0650\u064A\u0653 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u064A\u064F\u0624\u064E\u0627\u062E\u0650\u0630\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u064C \u062D\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 226, text: "\u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0644\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u062A\u064E\u0631\u064E\u0628\u0651\u064F\u0635\u064F \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064E\u0629\u0650 \u0623\u064E\u0634\u06E1\u0647\u064F\u0631\u0656\u06D6 \u0641\u064E\u0625\u0650\u0646 \u0641\u064E\u0627\u0653\u0621\u064F\u0648 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 227, text: "\u0648\u064E\u0625\u0650\u0646\u06E1 \u0639\u064E\u0632\u064E\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0637\u0651\u064E\u0644\u064E\u0670\u0642\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 228, text: "\u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0637\u064E\u0644\u0651\u064E\u0642\u064E\u0670\u062A\u064F \u064A\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u06E1\u0646\u064E \u0628\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0646\u0651\u064E \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u064E \u0642\u064F\u0631\u064F\u0648\u0653\u0621\u0656\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u0650\u0644\u0651\u064F \u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0623\u064E\u0646 \u064A\u064E\u0643\u06E1\u062A\u064F\u0645\u06E1\u0646\u064E \u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u0650\u0647\u0650\u0646\u0651\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u0651\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u06DA \u0648\u064E\u0628\u064F\u0639\u064F\u0648\u0644\u064E\u062A\u064F\u0647\u064F\u0646\u0651\u064E \u0623\u064E\u062D\u064E\u0642\u0651\u064F \u0628\u0650\u0631\u064E\u062F\u0651\u0650\u0647\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0635\u06E1\u0644\u064E\u0670\u062D\u0657\u0627\u06DA \u0648\u064E\u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0645\u0650\u062B\u06E1\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650\u06DA \u0648\u064E\u0644\u0650\u0644\u0631\u0651\u0650\u062C\u064E\u0627\u0644\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u062F\u064E\u0631\u064E\u062C\u064E\u0629\u065E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u064C" }, { id: 229, text: "\u0671\u0644\u0637\u0651\u064E\u0644\u064E\u0670\u0642\u064F \u0645\u064E\u0631\u0651\u064E\u062A\u064E\u0627\u0646\u0650\u06D6 \u0641\u064E\u0625\u0650\u0645\u06E1\u0633\u064E\u0627\u0643\u064F\u06E2 \u0628\u0650\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u064D \u0623\u064E\u0648\u06E1 \u062A\u064E\u0633\u06E1\u0631\u0650\u064A\u062D\u064F\u06E2 \u0628\u0650\u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u0656\u06D7 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u0650\u0644\u0651\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u062E\u064E\u0627\u0641\u064E\u0627\u0653 \u0623\u064E\u0644\u0651\u064E\u0627 \u064A\u064F\u0642\u0650\u064A\u0645\u064E\u0627 \u062D\u064F\u062F\u064F\u0648\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0641\u064E\u0625\u0650\u0646\u06E1 \u062E\u0650\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0644\u0651\u064E\u0627 \u064A\u064F\u0642\u0650\u064A\u0645\u064E\u0627 \u062D\u064F\u062F\u064F\u0648\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064E\u0627 \u0641\u0650\u064A\u0645\u064E\u0627 \u0671\u0641\u06E1\u062A\u064E\u062F\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u06E6\u06D7 \u062A\u0650\u0644\u06E1\u0643\u064E \u062D\u064F\u062F\u064F\u0648\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062A\u064E\u062F\u064F\u0648\u0647\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0639\u064E\u062F\u0651\u064E \u062D\u064F\u062F\u064F\u0648\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 230, text: "\u0641\u064E\u0625\u0650\u0646 \u0637\u064E\u0644\u0651\u064E\u0642\u064E\u0647\u064E\u0627 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u0650\u0644\u0651\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u064F \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0646\u0643\u0650\u062D\u064E \u0632\u064E\u0648\u06E1\u062C\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E\u0647\u064F\u06E5\u06D7 \u0641\u064E\u0625\u0650\u0646 \u0637\u064E\u0644\u0651\u064E\u0642\u064E\u0647\u064E\u0627 \u0641\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u062A\u064E\u0631\u064E\u0627\u062C\u064E\u0639\u064E\u0627\u0653 \u0625\u0650\u0646 \u0638\u064E\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u0642\u0650\u064A\u0645\u064E\u0627 \u062D\u064F\u062F\u064F\u0648\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u062D\u064F\u062F\u064F\u0648\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F\u0647\u064E\u0627 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 231, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0637\u064E\u0644\u0651\u064E\u0642\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0628\u064E\u0644\u064E\u063A\u06E1\u0646\u064E \u0623\u064E\u062C\u064E\u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0623\u064E\u0645\u06E1\u0633\u0650\u0643\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0628\u0650\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u064D \u0623\u064E\u0648\u06E1 \u0633\u064E\u0631\u0651\u0650\u062D\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0628\u0650\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0656\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0645\u06E1\u0633\u0650\u0643\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0636\u0650\u0631\u064E\u0627\u0631\u0657\u0627 \u0644\u0651\u0650\u062A\u064E\u0639\u06E1\u062A\u064E\u062F\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u06E1 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0642\u064E\u062F\u06E1 \u0638\u064E\u0644\u064E\u0645\u064E \u0646\u064E\u0641\u06E1\u0633\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0632\u064F\u0648\u0657\u0627\u06DA \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u0650 \u064A\u064E\u0639\u0650\u0638\u064F\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 232, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0637\u064E\u0644\u0651\u064E\u0642\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0628\u064E\u0644\u064E\u063A\u06E1\u0646\u064E \u0623\u064E\u062C\u064E\u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0636\u064F\u0644\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0623\u064E\u0646 \u064A\u064E\u0646\u0643\u0650\u062D\u06E1\u0646\u064E \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064E\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u0631\u064E\u0670\u0636\u064E\u0648\u06E1\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650\u06D7 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0648\u0639\u064E\u0638\u064F \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u06D7 \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0632\u06E1\u0643\u064E\u0649\u0670 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0637\u06E1\u0647\u064E\u0631\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 233, text: "\u06DE\u0648\u064E\u0671\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u0670\u062A\u064F \u064A\u064F\u0631\u06E1\u0636\u0650\u0639\u06E1\u0646\u064E \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064E\u0647\u064F\u0646\u0651\u064E \u062D\u064E\u0648\u06E1\u0644\u064E\u064A\u06E1\u0646\u0650 \u0643\u064E\u0627\u0645\u0650\u0644\u064E\u064A\u06E1\u0646\u0650\u06D6 \u0644\u0650\u0645\u064E\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0623\u064E\u0646 \u064A\u064F\u062A\u0650\u0645\u0651\u064E \u0671\u0644\u0631\u0651\u064E\u0636\u064E\u0627\u0639\u064E\u0629\u064E\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u0644\u064F\u0648\u062F\u0650 \u0644\u064E\u0647\u064F\u06E5 \u0631\u0650\u0632\u06E1\u0642\u064F\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0643\u0650\u0633\u06E1\u0648\u064E\u062A\u064F\u0647\u064F\u0646\u0651\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650\u06DA \u0644\u064E\u0627 \u062A\u064F\u0643\u064E\u0644\u0651\u064E\u0641\u064F \u0646\u064E\u0641\u06E1\u0633\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064F\u0633\u06E1\u0639\u064E\u0647\u064E\u0627\u06DA \u0644\u064E\u0627 \u062A\u064F\u0636\u064E\u0627\u0653\u0631\u0651\u064E \u0648\u064E\u0670\u0644\u0650\u062F\u064E\u0629\u064F\u06E2 \u0628\u0650\u0648\u064E\u0644\u064E\u062F\u0650\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u0645\u064E\u0648\u06E1\u0644\u064F\u0648\u062F\u065E \u0644\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0648\u064E\u0644\u064E\u062F\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0648\u064E\u0627\u0631\u0650\u062B\u0650 \u0645\u0650\u062B\u06E1\u0644\u064F \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D7 \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E\u0627 \u0641\u0650\u0635\u064E\u0627\u0644\u064B\u0627 \u0639\u064E\u0646 \u062A\u064E\u0631\u064E\u0627\u0636\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u062A\u064E\u0634\u064E\u0627\u0648\u064F\u0631\u0656 \u0641\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064E\u0627\u06D7 \u0648\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u062F\u062A\u0651\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0633\u06E1\u062A\u064E\u0631\u06E1\u0636\u0650\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u0644\u0651\u064E\u0645\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650\u06D7 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 234, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0648\u06E1\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0630\u064E\u0631\u064F\u0648\u0646\u064E \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u064A\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u06E1\u0646\u064E \u0628\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064E\u0629\u064E \u0623\u064E\u0634\u06E1\u0647\u064F\u0631\u0656 \u0648\u064E\u0639\u064E\u0634\u06E1\u0631\u0657\u0627\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u06E1\u0646\u064E \u0623\u064E\u062C\u064E\u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0645\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u06E1\u0646\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0646\u0651\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 235, text: "\u0648\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0645\u064E\u0627 \u0639\u064E\u0631\u0651\u064E\u0636\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u062E\u0650\u0637\u06E1\u0628\u064E\u0629\u0650 \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0643\u06E1\u0646\u064E\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1\u06DA \u0639\u064E\u0644\u0650\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0633\u064E\u062A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u064E\u0627 \u062A\u064F\u0648\u064E\u0627\u0639\u0650\u062F\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0633\u0650\u0631\u0651\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0645\u0651\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0657\u0627\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0632\u0650\u0645\u064F\u0648\u0627\u0652 \u0639\u064F\u0642\u06E1\u062F\u064E\u0629\u064E \u0671\u0644\u0646\u0651\u0650\u0643\u064E\u0627\u062D\u0650 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0628\u06E1\u0644\u064F\u063A\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064F \u0623\u064E\u062C\u064E\u0644\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u062D\u06E1\u0630\u064E\u0631\u064F\u0648\u0647\u064F\u06DA \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u064C \u062D\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 236, text: "\u0644\u0651\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0637\u064E\u0644\u0651\u064E\u0642\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0645\u064E\u0633\u0651\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0623\u064E\u0648\u06E1 \u062A\u064E\u0641\u06E1\u0631\u0650\u0636\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0631\u0650\u064A\u0636\u064E\u0629\u0657\u06DA \u0648\u064E\u0645\u064E\u062A\u0651\u0650\u0639\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0648\u0633\u0650\u0639\u0650 \u0642\u064E\u062F\u064E\u0631\u064F\u0647\u064F\u06E5 \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0642\u06E1\u062A\u0650\u0631\u0650 \u0642\u064E\u062F\u064E\u0631\u064F\u0647\u064F\u06E5 \u0645\u064E\u062A\u064E\u0670\u0639\u064E\u06E2\u0627 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650\u06D6 \u062D\u064E\u0642\u0651\u064B\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 237, text: "\u0648\u064E\u0625\u0650\u0646 \u0637\u064E\u0644\u0651\u064E\u0642\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u062A\u064E\u0645\u064E\u0633\u0651\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0642\u064E\u062F\u06E1 \u0641\u064E\u0631\u064E\u0636\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0631\u0650\u064A\u0636\u064E\u0629\u0657 \u0641\u064E\u0646\u0650\u0635\u06E1\u0641\u064F \u0645\u064E\u0627 \u0641\u064E\u0631\u064E\u0636\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0639\u06E1\u0641\u064F\u0648\u0646\u064E \u0623\u064E\u0648\u06E1 \u064A\u064E\u0639\u06E1\u0641\u064F\u0648\u064E\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u0650\u064A\u064E\u062F\u0650\u0647\u0650\u06E6 \u0639\u064F\u0642\u06E1\u062F\u064E\u0629\u064F \u0671\u0644\u0646\u0651\u0650\u0643\u064E\u0627\u062D\u0650\u06DA \u0648\u064E\u0623\u064E\u0646 \u062A\u064E\u0639\u06E1\u0641\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F \u0644\u0650\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u0633\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u064C" }, { id: 238, text: "\u062D\u064E\u0670\u0641\u0650\u0638\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u06E1\u0648\u064F\u0633\u06E1\u0637\u064E\u0649\u0670 \u0648\u064E\u0642\u064F\u0648\u0645\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0642\u064E\u0670\u0646\u0650\u062A\u0650\u064A\u0646\u064E" }, { id: 239, text: "\u0641\u064E\u0625\u0650\u0646\u06E1 \u062E\u0650\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0631\u0650\u062C\u064E\u0627\u0644\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0631\u064F\u0643\u06E1\u0628\u064E\u0627\u0646\u0657\u0627\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0645\u0650\u0646\u062A\u064F\u0645\u06E1 \u0641\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u0651\u064E\u0645\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 240, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0648\u06E1\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0630\u064E\u0631\u064F\u0648\u0646\u064E \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u0648\u064E\u0635\u0650\u064A\u0651\u064E\u0629\u0657 \u0644\u0651\u0650\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u062A\u064E\u0670\u0639\u064B\u0627 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062D\u064E\u0648\u06E1\u0644\u0650 \u063A\u064E\u064A\u06E1\u0631\u064E \u0625\u0650\u062E\u06E1\u0631\u064E\u0627\u062C\u0656\u06DA \u0641\u064E\u0625\u0650\u0646\u06E1 \u062E\u064E\u0631\u064E\u062C\u06E1\u0646\u064E \u0641\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0645\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u06E1\u0646\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0646\u0651\u064E \u0645\u0650\u0646 \u0645\u0651\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0656\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 241, text: "\u0648\u064E\u0644\u0650\u0644\u06E1\u0645\u064F\u0637\u064E\u0644\u0651\u064E\u0642\u064E\u0670\u062A\u0650 \u0645\u064E\u062A\u064E\u0670\u0639\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650\u06D6 \u062D\u064E\u0642\u0651\u064B\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 242, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 243, text: "\u06DE\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0631\u064E\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0623\u064F\u0644\u064F\u0648\u0641\u064C \u062D\u064E\u0630\u064E\u0631\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062D\u06E1\u064A\u064E\u0670\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0630\u064F\u0648 \u0641\u064E\u0636\u06E1\u0644\u064D \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 244, text: "\u0648\u064E\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 245, text: "\u0645\u0651\u064E\u0646 \u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0642\u06E1\u0631\u0650\u0636\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u0631\u06E1\u0636\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627 \u0641\u064E\u064A\u064F\u0636\u064E\u0670\u0639\u0650\u0641\u064E\u0647\u064F\u06E5 \u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0636\u06E1\u0639\u064E\u0627\u0641\u0657\u0627 \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u0657\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0642\u06E1\u0628\u0650\u0636\u064F \u0648\u064E\u064A\u064E\u0628\u06E1\u0635\u06DC\u064F\u0637\u064F \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 246, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0625\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0646\u064E\u0628\u0650\u064A\u0651\u0656 \u0644\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u0628\u06E1\u0639\u064E\u062B\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0645\u064E\u0644\u0650\u0643\u0657\u0627 \u0646\u0651\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0644\u06E1 \u0639\u064E\u0633\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u062A\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0642\u0650\u062A\u064E\u0627\u0644\u064F \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0627\u0652\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0644\u0651\u064E\u0627 \u0646\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0623\u064F\u062E\u06E1\u0631\u0650\u062C\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0626\u0650\u0646\u064E\u0627\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0643\u064F\u062A\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0642\u0650\u062A\u064E\u0627\u0644\u064F \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 247, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0628\u0650\u064A\u0651\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u062F\u06E1 \u0628\u064E\u0639\u064E\u062B\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0637\u064E\u0627\u0644\u064F\u0648\u062A\u064E \u0645\u064E\u0644\u0650\u0643\u0657\u0627\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u062D\u064E\u0642\u0651\u064F \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u0650 \u0645\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0624\u06E1\u062A\u064E \u0633\u064E\u0639\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0627\u0644\u0650\u06DA \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0635\u06E1\u0637\u064E\u0641\u064E\u0649\u0670\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0632\u064E\u0627\u062F\u064E\u0647\u064F\u06E5 \u0628\u064E\u0633\u06E1\u0637\u064E\u0629\u0657 \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0633\u06E1\u0645\u0650\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0624\u06E1\u062A\u0650\u064A \u0645\u064F\u0644\u06E1\u0643\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0670\u0633\u0650\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 248, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0628\u0650\u064A\u0651\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E \u0621\u064E\u0627\u064A\u064E\u0629\u064E \u0645\u064F\u0644\u06E1\u0643\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u062A\u0651\u064E\u0627\u0628\u064F\u0648\u062A\u064F \u0641\u0650\u064A\u0647\u0650 \u0633\u064E\u0643\u0650\u064A\u0646\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u0642\u0650\u064A\u0651\u064E\u0629\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E \u0621\u064E\u0627\u0644\u064F \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0621\u064E\u0627\u0644\u064F \u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u062A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F\u0647\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 249, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0641\u064E\u0635\u064E\u0644\u064E \u0637\u064E\u0627\u0644\u064F\u0648\u062A\u064F \u0628\u0650\u0671\u0644\u06E1\u062C\u064F\u0646\u064F\u0648\u062F\u0650 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u0628\u06E1\u062A\u064E\u0644\u0650\u064A\u0643\u064F\u0645 \u0628\u0650\u0646\u064E\u0647\u064E\u0631\u0656 \u0641\u064E\u0645\u064E\u0646 \u0634\u064E\u0631\u0650\u0628\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0641\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0645\u0650\u0646\u0651\u0650\u064A \u0648\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0637\u06E1\u0639\u064E\u0645\u06E1\u0647\u064F \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u0651\u0650\u064A\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u0650 \u0671\u063A\u06E1\u062A\u064E\u0631\u064E\u0641\u064E \u063A\u064F\u0631\u06E1\u0641\u064E\u0629\u064E\u06E2 \u0628\u0650\u064A\u064E\u062F\u0650\u0647\u0650\u06E6\u06DA \u0641\u064E\u0634\u064E\u0631\u0650\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06DA \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0648\u064E\u0632\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u0637\u064E\u0627\u0642\u064E\u0629\u064E \u0644\u064E\u0646\u064E\u0627 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0628\u0650\u062C\u064E\u0627\u0644\u064F\u0648\u062A\u064E \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u0650\u0647\u0650\u06E6\u06DA \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0638\u064F\u0646\u0651\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0644\u064E\u0670\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0645 \u0645\u0651\u0650\u0646 \u0641\u0650\u0626\u064E\u0629\u0656 \u0642\u064E\u0644\u0650\u064A\u0644\u064E\u0629\u064D \u063A\u064E\u0644\u064E\u0628\u064E\u062A\u06E1 \u0641\u0650\u0626\u064E\u0629\u0657 \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u064E\u06E2 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0639\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 250, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0628\u064E\u0631\u064E\u0632\u064F\u0648\u0627\u0652 \u0644\u0650\u062C\u064E\u0627\u0644\u064F\u0648\u062A\u064E \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u0650\u0647\u0650\u06E6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0641\u06E1\u0631\u0650\u063A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0635\u064E\u0628\u06E1\u0631\u0657\u0627 \u0648\u064E\u062B\u064E\u0628\u0651\u0650\u062A\u06E1 \u0623\u064E\u0642\u06E1\u062F\u064E\u0627\u0645\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u0646\u0635\u064F\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 251, text: "\u0641\u064E\u0647\u064E\u0632\u064E\u0645\u064F\u0648\u0647\u064F\u0645 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0642\u064E\u062A\u064E\u0644\u064E \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064F \u062C\u064E\u0627\u0644\u064F\u0648\u062A\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0648\u064E\u0639\u064E\u0644\u0651\u064E\u0645\u064E\u0647\u064F\u06E5 \u0645\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u062F\u064E\u0641\u06E1\u0639\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u0645 \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0644\u0651\u064E\u0641\u064E\u0633\u064E\u062F\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0630\u064F\u0648 \u0641\u064E\u0636\u06E1\u0644\u064D \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 252, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0646\u064E\u062A\u06E1\u0644\u064F\u0648\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 253, text: "\u06DE\u062A\u0650\u0644\u06E1\u0643\u064E \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064F \u0641\u064E\u0636\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656\u06D8 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u0643\u064E\u0644\u0651\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0648\u064E\u0631\u064E\u0641\u064E\u0639\u064E \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u0645\u06E1 \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u0656\u06DA \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064E \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0623\u064E\u064A\u0651\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u0650\u0631\u064F\u0648\u062D\u0650 \u0671\u0644\u06E1\u0642\u064F\u062F\u064F\u0633\u0650\u06D7 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u0671\u0642\u06E1\u062A\u064E\u062A\u064E\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0650 \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0627\u0652 \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u0671\u0642\u06E1\u062A\u064E\u062A\u064E\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F" }, { id: 254, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u064A\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u0628\u064E\u064A\u06E1\u0639\u065E \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u062E\u064F\u0644\u0651\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0627 \u0634\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u065E\u06D7 \u0648\u064E\u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 255, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u064F \u0671\u0644\u06E1\u0642\u064E\u064A\u0651\u064F\u0648\u0645\u064F\u06DA \u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0647\u064F\u06E5 \u0633\u0650\u0646\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0648\u06E1\u0645\u065E\u06DA \u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0645\u064E\u0646 \u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0634\u06E1\u0641\u064E\u0639\u064F \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u0647\u0650\u06E6\u06DA \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u06E1\u0641\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u064A\u0637\u064F\u0648\u0646\u064E \u0628\u0650\u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0644\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u0634\u064E\u0627\u0653\u0621\u064E\u06DA \u0648\u064E\u0633\u0650\u0639\u064E \u0643\u064F\u0631\u06E1\u0633\u0650\u064A\u0651\u064F\u0647\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0640\u0654\u064F\u0648\u062F\u064F\u0647\u064F\u06E5 \u062D\u0650\u0641\u06E1\u0638\u064F\u0647\u064F\u0645\u064E\u0627\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 256, text: "\u0644\u064E\u0627\u0653 \u0625\u0650\u0643\u06E1\u0631\u064E\u0627\u0647\u064E \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650\u06D6 \u0642\u064E\u062F \u062A\u0651\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0671\u0644\u0631\u0651\u064F\u0634\u06E1\u062F\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u064A\u0651\u0650\u06DA \u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u06E1 \u0628\u0650\u0671\u0644\u0637\u0651\u064E\u0640\u0670\u063A\u064F\u0648\u062A\u0650 \u0648\u064E\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u06E2 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0642\u064E\u062F\u0650 \u0671\u0633\u06E1\u062A\u064E\u0645\u06E1\u0633\u064E\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u0639\u064F\u0631\u06E1\u0648\u064E\u0629\u0650 \u0671\u0644\u06E1\u0648\u064F\u062B\u06E1\u0642\u064E\u0649\u0670 \u0644\u064E\u0627 \u0671\u0646\u0641\u0650\u0635\u064E\u0627\u0645\u064E \u0644\u064E\u0647\u064E\u0627\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 257, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u0650\u064A\u0651\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064F\u0648\u0631\u0650\u06D6 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0637\u0651\u064E\u0640\u0670\u063A\u064F\u0648\u062A\u064F \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064F\u0648\u0631\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650\u06D7 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 258, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062D\u064E\u0627\u0653\u062C\u0651\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064E \u0641\u0650\u064A \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u06E1 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064E \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064F \u0631\u064E\u0628\u0651\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u064A\u064F\u0645\u0650\u064A\u062A\u064F \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0646\u064E\u0627\u06E0 \u0623\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u0623\u064F\u0645\u0650\u064A\u062A\u064F\u06D6 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064F \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0623\u06E1\u062A\u0650\u064A \u0628\u0650\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0631\u0650\u0642\u0650 \u0641\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u0647\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0631\u0650\u0628\u0650 \u0641\u064E\u0628\u064F\u0647\u0650\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064E\u0641\u064E\u0631\u064E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 259, text: "\u0623\u064E\u0648\u06E1 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0645\u064E\u0631\u0651\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0656 \u0648\u064E\u0647\u0650\u064A\u064E \u062E\u064E\u0627\u0648\u0650\u064A\u064E\u0629\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064F\u0631\u064F\u0648\u0634\u0650\u0647\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627\u06D6 \u0641\u064E\u0623\u064E\u0645\u064E\u0627\u062A\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0627\u0652\u0626\u064E\u0629\u064E \u0639\u064E\u0627\u0645\u0656 \u062B\u064F\u0645\u0651\u064E \u0628\u064E\u0639\u064E\u062B\u064E\u0647\u064F\u06E5\u06D6 \u0642\u064E\u0627\u0644\u064E \u0643\u064E\u0645\u06E1 \u0644\u064E\u0628\u0650\u062B\u06E1\u062A\u064E\u06D6 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0628\u0650\u062B\u06E1\u062A\u064F \u064A\u064E\u0648\u06E1\u0645\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0628\u064E\u0639\u06E1\u0636\u064E \u064A\u064E\u0648\u06E1\u0645\u0656\u06D6 \u0642\u064E\u0627\u0644\u064E \u0628\u064E\u0644 \u0644\u0651\u064E\u0628\u0650\u062B\u06E1\u062A\u064E \u0645\u0650\u0627\u0652\u0626\u064E\u0629\u064E \u0639\u064E\u0627\u0645\u0656 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0637\u064E\u0639\u064E\u0627\u0645\u0650\u0643\u064E \u0648\u064E\u0634\u064E\u0631\u064E\u0627\u0628\u0650\u0643\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u062A\u064E\u0633\u064E\u0646\u0651\u064E\u0647\u06E1\u06D6 \u0648\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u062D\u0650\u0645\u064E\u0627\u0631\u0650\u0643\u064E \u0648\u064E\u0644\u0650\u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064E\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06D6 \u0648\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u0650\u0638\u064E\u0627\u0645\u0650 \u0643\u064E\u064A\u06E1\u0641\u064E \u0646\u064F\u0646\u0634\u0650\u0632\u064F\u0647\u064E\u0627 \u062B\u064F\u0645\u0651\u064E \u0646\u064E\u0643\u06E1\u0633\u064F\u0648\u0647\u064E\u0627 \u0644\u064E\u062D\u06E1\u0645\u0657\u0627\u06DA \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 260, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u0640\u06E7\u0645\u064F \u0631\u064E\u0628\u0651\u0650 \u0623\u064E\u0631\u0650\u0646\u0650\u064A \u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670\u06D6 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u06D6 \u0642\u064E\u0627\u0644\u064E \u0628\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u0650\u064A\u064E\u0637\u06E1\u0645\u064E\u0626\u0650\u0646\u0651\u064E \u0642\u064E\u0644\u06E1\u0628\u0650\u064A\u06D6 \u0642\u064E\u0627\u0644\u064E \u0641\u064E\u062E\u064F\u0630\u06E1 \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u0650 \u0641\u064E\u0635\u064F\u0631\u06E1\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u062B\u064F\u0645\u0651\u064E \u0671\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u062C\u064E\u0628\u064E\u0644\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0646\u0651\u064E \u062C\u064F\u0632\u06E1\u0621\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0671\u062F\u06E1\u0639\u064F\u0647\u064F\u0646\u0651\u064E \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E\u0643\u064E \u0633\u064E\u0639\u06E1\u064A\u0657\u0627\u06DA \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 261, text: "\u0645\u0651\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u062D\u064E\u0628\u0651\u064E\u0629\u064D \u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u064E\u062A\u06E1 \u0633\u064E\u0628\u06E1\u0639\u064E \u0633\u064E\u0646\u064E\u0627\u0628\u0650\u0644\u064E \u0641\u0650\u064A \u0643\u064F\u0644\u0651\u0650 \u0633\u064F\u0646\u06E2\u0628\u064F\u0644\u064E\u0629\u0656 \u0645\u0651\u0650\u0627\u0652\u0626\u064E\u0629\u064F \u062D\u064E\u0628\u0651\u064E\u0629\u0656\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0636\u064E\u0670\u0639\u0650\u0641\u064F \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0670\u0633\u0650\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 262, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064F\u062A\u06E1\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u064E\u0646\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0630\u0657\u0649 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 263, text: "\u06DE\u0642\u064E\u0648\u06E1\u0644\u065E \u0645\u0651\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u065E \u0648\u064E\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u064C \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646 \u0635\u064E\u062F\u064E\u0642\u064E\u0629\u0656 \u064A\u064E\u062A\u06E1\u0628\u064E\u0639\u064F\u0647\u064E\u0627\u0653 \u0623\u064E\u0630\u0657\u0649\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0646\u0650\u064A\u0651\u064C \u062D\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 264, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064F\u0628\u06E1\u0637\u0650\u0644\u064F\u0648\u0627\u0652 \u0635\u064E\u062F\u064E\u0642\u064E\u0670\u062A\u0650\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0646\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0630\u064E\u0649\u0670 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0646\u0641\u0650\u0642\u064F \u0645\u064E\u0627\u0644\u064E\u0647\u064F\u06E5 \u0631\u0650\u0626\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u06D6 \u0641\u064E\u0645\u064E\u062B\u064E\u0644\u064F\u0647\u064F\u06E5 \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u0635\u064E\u0641\u06E1\u0648\u064E\u0627\u0646\u064D \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u064E\u0627\u0628\u065E \u0641\u064E\u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064F\u06E5 \u0648\u064E\u0627\u0628\u0650\u0644\u065E \u0641\u064E\u062A\u064E\u0631\u064E\u0643\u064E\u0647\u064F\u06E5 \u0635\u064E\u0644\u06E1\u062F\u0657\u0627\u06D6 \u0644\u0651\u064E\u0627 \u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 265, text: "\u0648\u064E\u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0631\u06E1\u0636\u064E\u0627\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u062A\u064E\u062B\u06E1\u0628\u0650\u064A\u062A\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u062C\u064E\u0646\u0651\u064E\u0629\u0650\u06ED \u0628\u0650\u0631\u064E\u0628\u06E1\u0648\u064E\u0629\u064D \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064E\u0627 \u0648\u064E\u0627\u0628\u0650\u0644\u065E \u0641\u064E\u0640\u0654\u064E\u0627\u062A\u064E\u062A\u06E1 \u0623\u064F\u0643\u064F\u0644\u064E\u0647\u064E\u0627 \u0636\u0650\u0639\u06E1\u0641\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064F\u0635\u0650\u0628\u06E1\u0647\u064E\u0627 \u0648\u064E\u0627\u0628\u0650\u0644\u065E \u0641\u064E\u0637\u064E\u0644\u0651\u065E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u064C" }, { id: 266, text: "\u0623\u064E\u064A\u064E\u0648\u064E\u062F\u0651\u064F \u0623\u064E\u062D\u064E\u062F\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u062C\u064E\u0646\u0651\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u062E\u0650\u064A\u0644\u0656 \u0648\u064E\u0623\u064E\u0639\u06E1\u0646\u064E\u0627\u0628\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u0648\u064E\u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064F \u0671\u0644\u06E1\u0643\u0650\u0628\u064E\u0631\u064F \u0648\u064E\u0644\u064E\u0647\u064F\u06E5 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u065E \u0636\u064F\u0639\u064E\u0641\u064E\u0627\u0653\u0621\u064F \u0641\u064E\u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064E\u0627\u0653 \u0625\u0650\u0639\u06E1\u0635\u064E\u0627\u0631\u065E \u0641\u0650\u064A\u0647\u0650 \u0646\u064E\u0627\u0631\u065E \u0641\u064E\u0671\u062D\u06E1\u062A\u064E\u0631\u064E\u0642\u064E\u062A\u06E1\u06D7 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 267, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u064A\u064E\u0645\u0651\u064E\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u064E\u0633\u06E1\u062A\u064F\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u062E\u0650\u0630\u0650\u064A\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064F\u063A\u06E1\u0645\u0650\u0636\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650\u06DA \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0646\u0650\u064A\u0651\u064C \u062D\u064E\u0645\u0650\u064A\u062F\u064C" }, { id: 268, text: "\u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u064A\u064E\u0639\u0650\u062F\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0642\u06E1\u0631\u064E \u0648\u064E\u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0641\u064E\u062D\u06E1\u0634\u064E\u0627\u0653\u0621\u0650\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u0650\u062F\u064F\u0643\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u0641\u064E\u0636\u06E1\u0644\u0657\u0627\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0670\u0633\u0650\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 269, text: "\u064A\u064F\u0624\u06E1\u062A\u0650\u064A \u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u062A\u064E \u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0641\u064E\u0642\u064E\u062F\u06E1 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627\u06D7 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 270, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0641\u064E\u0642\u064E\u0629\u064D \u0623\u064E\u0648\u06E1 \u0646\u064E\u0630\u064E\u0631\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0630\u06E1\u0631\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0647\u064F\u06E5\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0644\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u0635\u064E\u0627\u0631\u064D" }, { id: 271, text: "\u0625\u0650\u0646 \u062A\u064F\u0628\u06E1\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u062F\u064E\u0642\u064E\u0670\u062A\u0650 \u0641\u064E\u0646\u0650\u0639\u0650\u0645\u0651\u064E\u0627 \u0647\u0650\u064A\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u062E\u06E1\u0641\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u062A\u064F\u0624\u06E1\u062A\u064F\u0648\u0647\u064E\u0627 \u0671\u0644\u06E1\u0641\u064F\u0642\u064E\u0631\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u064A\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u064F \u0639\u064E\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 272, text: "\u06DE\u0644\u0651\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0647\u064F\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u0641\u064E\u0644\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u062C\u06E1\u0647\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u064A\u064F\u0648\u064E\u0641\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 273, text: "\u0644\u0650\u0644\u06E1\u0641\u064F\u0642\u064E\u0631\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u062D\u06E1\u0635\u0650\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0636\u064E\u0631\u06E1\u0628\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062C\u064E\u0627\u0647\u0650\u0644\u064F \u0623\u064E\u063A\u06E1\u0646\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u062A\u0651\u064E\u0639\u064E\u0641\u0651\u064F\u0641\u0650 \u062A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0647\u064F\u0645 \u0628\u0650\u0633\u0650\u064A\u0645\u064E\u0670\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0625\u0650\u0644\u06E1\u062D\u064E\u0627\u0641\u0657\u0627\u06D7 \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 274, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0633\u0650\u0631\u0651\u0657\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u0657 \u0641\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 275, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u0628\u064E\u0648\u0670\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0645\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u062A\u064E\u062E\u064E\u0628\u0651\u064E\u0637\u064F\u0647\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u0651\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u0639\u064F \u0645\u0650\u062B\u06E1\u0644\u064F \u0671\u0644\u0631\u0651\u0650\u0628\u064E\u0648\u0670\u0627\u0652\u06D7 \u0648\u064E\u0623\u064E\u062D\u064E\u0644\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u0639\u064E \u0648\u064E\u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0671\u0644\u0631\u0651\u0650\u0628\u064E\u0648\u0670\u0627\u0652\u06DA \u0641\u064E\u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u06E5 \u0645\u064E\u0648\u06E1\u0639\u0650\u0638\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0641\u064E\u0671\u0646\u062A\u064E\u0647\u064E\u0649\u0670 \u0641\u064E\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0633\u064E\u0644\u064E\u0641\u064E \u0648\u064E\u0623\u064E\u0645\u06E1\u0631\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0639\u064E\u0627\u062F\u064E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 276, text: "\u064A\u064E\u0645\u06E1\u062D\u064E\u0642\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0631\u0651\u0650\u0628\u064E\u0648\u0670\u0627\u0652 \u0648\u064E\u064A\u064F\u0631\u06E1\u0628\u0650\u064A \u0671\u0644\u0635\u0651\u064E\u062F\u064E\u0642\u064E\u0670\u062A\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0643\u064F\u0644\u0651\u064E \u0643\u064E\u0641\u0651\u064E\u0627\u0631\u064D \u0623\u064E\u062B\u0650\u064A\u0645\u064D" }, { id: 277, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0648\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 278, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0630\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0628\u064E\u0642\u0650\u064A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u0628\u064E\u0648\u0670\u0653\u0627\u0652 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 279, text: "\u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u06E1\u0630\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u062D\u064E\u0631\u06E1\u0628\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064F\u0621\u064F\u0648\u0633\u064F \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 280, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0630\u064F\u0648 \u0639\u064F\u0633\u06E1\u0631\u064E\u0629\u0656 \u0641\u064E\u0646\u064E\u0638\u0650\u0631\u064E\u0629\u064C \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u064A\u06E1\u0633\u064E\u0631\u064E\u0629\u0656\u06DA \u0648\u064E\u0623\u064E\u0646 \u062A\u064E\u0635\u064E\u062F\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 281, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u064A\u064E\u0648\u06E1\u0645\u0657\u0627 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u062B\u064F\u0645\u0651\u064E \u062A\u064F\u0648\u064E\u0641\u0651\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 282, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u062F\u064E\u0627\u064A\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u062F\u064E\u064A\u06E1\u0646\u064D \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649 \u0641\u064E\u0671\u0643\u06E1\u062A\u064F\u0628\u064F\u0648\u0647\u064F\u06DA \u0648\u064E\u0644\u06E1\u064A\u064E\u0643\u06E1\u062A\u064F\u0628 \u0628\u0651\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0643\u064E\u0627\u062A\u0650\u0628\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u062F\u06E1\u0644\u0650\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u0628\u064E \u0643\u064E\u0627\u062A\u0650\u0628\u064C \u0623\u064E\u0646 \u064A\u064E\u0643\u06E1\u062A\u064F\u0628\u064E \u0643\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u0651\u064E\u0645\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0641\u064E\u0644\u06E1\u064A\u064E\u0643\u06E1\u062A\u064F\u0628\u06E1 \u0648\u064E\u0644\u06E1\u064A\u064F\u0645\u06E1\u0644\u0650\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0644\u06E1\u064A\u064E\u062A\u0651\u064E\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0628\u06E1\u062E\u064E\u0633\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064F \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06DA \u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0633\u064E\u0641\u0650\u064A\u0647\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0636\u064E\u0639\u0650\u064A\u0641\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F \u0623\u064E\u0646 \u064A\u064F\u0645\u0650\u0644\u0651\u064E \u0647\u064F\u0648\u064E \u0641\u064E\u0644\u06E1\u064A\u064F\u0645\u06E1\u0644\u0650\u0644\u06E1 \u0648\u064E\u0644\u0650\u064A\u0651\u064F\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u062F\u06E1\u0644\u0650\u06DA \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0634\u06E1\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0634\u064E\u0647\u0650\u064A\u062F\u064E\u064A\u06E1\u0646\u0650 \u0645\u0650\u0646 \u0631\u0651\u0650\u062C\u064E\u0627\u0644\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0648\u0646\u064E\u0627 \u0631\u064E\u062C\u064F\u0644\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u0631\u064E\u062C\u064F\u0644\u065E \u0648\u064E\u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E\u0627\u0646\u0650 \u0645\u0650\u0645\u0651\u064E\u0646 \u062A\u064E\u0631\u06E1\u0636\u064E\u0648\u06E1\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u0646 \u062A\u064E\u0636\u0650\u0644\u0651\u064E \u0625\u0650\u062D\u06E1\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u064E\u0627 \u0641\u064E\u062A\u064F\u0630\u064E\u0643\u0651\u0650\u0631\u064E \u0625\u0650\u062D\u06E1\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u06E1\u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u0628\u064E \u0671\u0644\u0634\u0651\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064F \u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627 \u062F\u064F\u0639\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u0640\u0654\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u062A\u064E\u0643\u06E1\u062A\u064F\u0628\u064F\u0648\u0647\u064F \u0635\u064E\u063A\u0650\u064A\u0631\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0643\u064E\u0628\u0650\u064A\u0631\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0650\u0647\u0650\u06E6\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0642\u06E1\u0633\u064E\u0637\u064F \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u0642\u06E1\u0648\u064E\u0645\u064F \u0644\u0650\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650 \u0648\u064E\u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670\u0653 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0631\u06E1\u062A\u064E\u0627\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u062A\u0650\u062C\u064E\u0670\u0631\u064E\u0629\u064B \u062D\u064E\u0627\u0636\u0650\u0631\u064E\u0629\u0657 \u062A\u064F\u062F\u0650\u064A\u0631\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062C\u064F\u0646\u064E\u0627\u062D\u064C \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0643\u06E1\u062A\u064F\u0628\u064F\u0648\u0647\u064E\u0627\u06D7 \u0648\u064E\u0623\u064E\u0634\u06E1\u0647\u0650\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u0628\u064E\u0627\u064A\u064E\u0639\u06E1\u062A\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0636\u064E\u0627\u0653\u0631\u0651\u064E \u0643\u064E\u0627\u062A\u0650\u0628\u065E \u0648\u064E\u0644\u064E\u0627 \u0634\u064E\u0647\u0650\u064A\u062F\u065E\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0641\u064F\u0633\u064F\u0648\u0642\u064F\u06E2 \u0628\u0650\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06D6 \u0648\u064E\u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 283, text: "\u06DE\u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064E\u0641\u064E\u0631\u0656 \u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0643\u064E\u0627\u062A\u0650\u0628\u0657\u0627 \u0641\u064E\u0631\u0650\u0647\u064E\u0670\u0646\u065E \u0645\u0651\u064E\u0642\u06E1\u0628\u064F\u0648\u0636\u064E\u0629\u065E\u06D6 \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0645\u0650\u0646\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u0657\u0627 \u0641\u064E\u0644\u06E1\u064A\u064F\u0624\u064E\u062F\u0651\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0671\u0624\u06E1\u062A\u064F\u0645\u0650\u0646\u064E \u0623\u064E\u0645\u064E\u0670\u0646\u064E\u062A\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u06E1\u064A\u064E\u062A\u0651\u064E\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5\u06D7 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u064E\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u062A\u064F\u0645\u06E1\u0647\u064E\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5\u0653 \u0621\u064E\u0627\u062B\u0650\u0645\u065E \u0642\u064E\u0644\u06E1\u0628\u064F\u0647\u064F\u06E5\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 284, text: "\u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0628\u06E1\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u062A\u064F\u062E\u06E1\u0641\u064F\u0648\u0647\u064F \u064A\u064F\u062D\u064E\u0627\u0633\u0650\u0628\u06E1\u0643\u064F\u0645 \u0628\u0650\u0647\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0641\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 285, text: "\u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E\u06DA \u0643\u064F\u0644\u0651\u064C \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0643\u064F\u062A\u064F\u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6 \u0644\u064E\u0627 \u0646\u064F\u0641\u064E\u0631\u0651\u0650\u0642\u064F \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627\u06D6 \u063A\u064F\u0641\u06E1\u0631\u064E\u0627\u0646\u064E\u0643\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 286, text: "\u0644\u064E\u0627 \u064A\u064F\u0643\u064E\u0644\u0651\u0650\u0641\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0646\u064E\u0641\u06E1\u0633\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064F\u0633\u06E1\u0639\u064E\u0647\u064E\u0627\u06DA \u0644\u064E\u0647\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0648\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0645\u064E\u0627 \u0671\u0643\u06E1\u062A\u064E\u0633\u064E\u0628\u064E\u062A\u06E1\u06D7 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u064E\u0627 \u062A\u064F\u0624\u064E\u0627\u062E\u0650\u0630\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0646 \u0646\u0651\u064E\u0633\u0650\u064A\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0623\u064E\u062E\u06E1\u0637\u064E\u0623\u06E1\u0646\u064E\u0627\u06DA \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0645\u0650\u0644\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0635\u06E1\u0631\u0657\u0627 \u0643\u064E\u0645\u064E\u0627 \u062D\u064E\u0645\u064E\u0644\u06E1\u062A\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0646\u064E\u0627\u06DA \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062D\u064E\u0645\u0651\u0650\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0644\u064E\u0627 \u0637\u064E\u0627\u0642\u064E\u0629\u064E \u0644\u064E\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0671\u0639\u06E1\u0641\u064F \u0639\u064E\u0646\u0651\u064E\u0627 \u0648\u064E\u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u0631\u06E1\u062D\u064E\u0645\u06E1\u0646\u064E\u0627\u0653\u06DA \u0623\u064E\u0646\u062A\u064E \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0646\u064E\u0627 \u0641\u064E\u0671\u0646\u0635\u064F\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }] }, { id: 3, name: "\u0622\u0644 \u0639\u0645\u0631\u0627\u0646", transliteration: "Ali 'Imran", type: "medinan", total_verses: 200, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0645\u0653" }, { id: 2, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u064F \u0671\u0644\u06E1\u0642\u064E\u064A\u0651\u064F\u0648\u0645\u064F" }, { id: 3, text: "\u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u064E" }, { id: 4, text: "\u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0647\u064F\u062F\u0657\u0649 \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u06E1\u0641\u064F\u0631\u06E1\u0642\u064E\u0627\u0646\u064E\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u065E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u065E \u0630\u064F\u0648 \u0671\u0646\u062A\u0650\u0642\u064E\u0627\u0645\u064D" }, { id: 5, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u062E\u06E1\u0641\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0634\u064E\u064A\u06E1\u0621\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650" }, { id: 6, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0635\u064E\u0648\u0651\u0650\u0631\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u0650 \u0643\u064E\u064A\u06E1\u0641\u064E \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 7, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u065E \u0645\u0651\u064F\u062D\u06E1\u0643\u064E\u0645\u064E\u0670\u062A\u064C \u0647\u064F\u0646\u0651\u064E \u0623\u064F\u0645\u0651\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0623\u064F\u062E\u064E\u0631\u064F \u0645\u064F\u062A\u064E\u0634\u064E\u0670\u0628\u0650\u0647\u064E\u0670\u062A\u065E\u06D6 \u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0632\u064E\u064A\u06E1\u063A\u065E \u0641\u064E\u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u062A\u064E\u0634\u064E\u0670\u0628\u064E\u0647\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u06E1\u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0650 \u0648\u064E\u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0633\u0650\u062E\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0643\u064F\u0644\u0651\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627\u06D7 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 8, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u064E\u0627 \u062A\u064F\u0632\u0650\u063A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064E\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0630\u06E1 \u0647\u064E\u062F\u064E\u064A\u06E1\u062A\u064E\u0646\u064E\u0627 \u0648\u064E\u0647\u064E\u0628\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0643\u064E \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u064B\u06DA \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u06E1\u0648\u064E\u0647\u0651\u064E\u0627\u0628\u064F" }, { id: 9, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u062C\u064E\u0627\u0645\u0650\u0639\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u0650\u064A\u064E\u0648\u06E1\u0645\u0656 \u0644\u0651\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062E\u06E1\u0644\u0650\u0641\u064F \u0671\u0644\u06E1\u0645\u0650\u064A\u0639\u064E\u0627\u062F\u064E" }, { id: 10, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u062A\u064F\u063A\u06E1\u0646\u0650\u064A\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064F\u0648\u062F\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 11, text: "\u0643\u064E\u062F\u064E\u0623\u06E1\u0628\u0650 \u0621\u064E\u0627\u0644\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 12, text: "\u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0633\u064E\u062A\u064F\u063A\u06E1\u0644\u064E\u0628\u064F\u0648\u0646\u064E \u0648\u064E\u062A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u0650\u0647\u064E\u0627\u062F\u064F" }, { id: 13, text: "\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u065E \u0641\u0650\u064A \u0641\u0650\u0626\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0671\u0644\u06E1\u062A\u064E\u0642\u064E\u062A\u064E\u0627\u06D6 \u0641\u0650\u0626\u064E\u0629\u065E \u062A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670 \u0643\u064E\u0627\u0641\u0650\u0631\u064E\u0629\u065E \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u062B\u06E1\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0631\u064E\u0623\u06E1\u064A\u064E \u0671\u0644\u06E1\u0639\u064E\u064A\u06E1\u0646\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0624\u064E\u064A\u0651\u0650\u062F\u064F \u0628\u0650\u0646\u064E\u0635\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0639\u0650\u0628\u06E1\u0631\u064E\u0629\u0657 \u0644\u0651\u0650\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650" }, { id: 14, text: "\u0632\u064F\u064A\u0651\u0650\u0646\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u062D\u064F\u0628\u0651\u064F \u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0648\u064E\u0670\u062A\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0646\u064E\u0670\u0637\u0650\u064A\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0646\u0637\u064E\u0631\u064E\u0629\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0630\u0651\u064E\u0647\u064E\u0628\u0650 \u0648\u064E\u0671\u0644\u06E1\u0641\u0650\u0636\u0651\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u0633\u064E\u0648\u0651\u064E\u0645\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u0631\u06E1\u062B\u0650\u06D7 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u062A\u064E\u0670\u0639\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u062D\u064F\u0633\u06E1\u0646\u064F \u0671\u0644\u06E1\u0645\u064E\u0640\u0654\u064E\u0627\u0628\u0650" }, { id: 15, text: "\u06DE\u0642\u064F\u0644\u06E1 \u0623\u064E\u0624\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u062E\u064E\u064A\u06E1\u0631\u0656 \u0645\u0651\u0650\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u065E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u065E \u0645\u0651\u064F\u0637\u064E\u0647\u0651\u064E\u0631\u064E\u0629\u065E \u0648\u064E\u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u0635\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0639\u0650\u0628\u064E\u0627\u062F\u0650" }, { id: 16, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0641\u064E\u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0630\u064F\u0646\u064F\u0648\u0628\u064E\u0646\u064E\u0627 \u0648\u064E\u0642\u0650\u0646\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 17, text: "\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0670\u0646\u0650\u062A\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u062D\u064E\u0627\u0631\u0650" }, { id: 18, text: "\u0634\u064E\u0647\u0650\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u064E\u06E2\u0627 \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650\u06DA \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 19, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0625\u0650\u0633\u06E1\u0644\u064E\u0670\u0645\u064F\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064F \u0628\u064E\u063A\u06E1\u064A\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u06E1 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0631\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 20, text: "\u0641\u064E\u0625\u0650\u0646\u06E1 \u062D\u064E\u0627\u0653\u062C\u0651\u064F\u0648\u0643\u064E \u0641\u064E\u0642\u064F\u0644\u06E1 \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u06E1\u062A\u064F \u0648\u064E\u062C\u06E1\u0647\u0650\u064A\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E\u0646\u0650\u06D7 \u0648\u064E\u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064F\u0645\u0651\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0621\u064E\u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u06E1\u062A\u064F\u0645\u06E1\u06DA \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0641\u064E\u0642\u064E\u062F\u0650 \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0648\u0627\u0652\u06D6 \u0648\u0651\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u0635\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0639\u0650\u0628\u064E\u0627\u062F\u0650" }, { id: 21, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u064E\u0642\u0651\u0656 \u0648\u064E\u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0641\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u06E1\u0647\u064F\u0645 \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u064D" }, { id: 22, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062D\u064E\u0628\u0650\u0637\u064E\u062A\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0640\u0670\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 23, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0646\u064E\u0635\u0650\u064A\u0628\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u064A\u064F\u062F\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u0650\u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u062A\u064E\u0645\u064E\u0633\u0651\u064E\u0646\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0657\u0627 \u0645\u0651\u064E\u0639\u06E1\u062F\u064F\u0648\u062F\u064E\u0670\u062A\u0656\u06D6 \u0648\u064E\u063A\u064E\u0631\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u062F\u0650\u064A\u0646\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0645\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u0648\u06E1\u0645\u0656 \u0644\u0651\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0648\u064F\u0641\u0651\u0650\u064A\u064E\u062A\u06E1 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u0645\u0651\u064E \u0645\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u0650 \u062A\u064F\u0624\u06E1\u062A\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064E \u0645\u064E\u0646 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u062A\u064E\u0646\u0632\u0650\u0639\u064F \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064E \u0645\u0650\u0645\u0651\u064E\u0646 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u062A\u064F\u0639\u0650\u0632\u0651\u064F \u0645\u064E\u0646 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u062A\u064F\u0630\u0650\u0644\u0651\u064F \u0645\u064E\u0646 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0628\u0650\u064A\u064E\u062F\u0650\u0643\u064E \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064F\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 27, text: "\u062A\u064F\u0648\u0644\u0650\u062C\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u062A\u064F\u0648\u0644\u0650\u062C\u064F \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650\u06D6 \u0648\u064E\u062A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u064A\u0651\u0650\u062A\u0650 \u0648\u064E\u062A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u0651\u0650\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u0650\u06D6 \u0648\u064E\u062A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F \u0645\u064E\u0646 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u0650\u0633\u064E\u0627\u0628\u0656" }, { id: 28, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u06E1 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u0650\u064A \u0634\u064E\u064A\u06E1\u0621\u064D \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062A\u064F\u0642\u064E\u0649\u0670\u0629\u0657\u06D7 \u0648\u064E\u064A\u064F\u062D\u064E\u0630\u0651\u0650\u0631\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0646\u064E\u0641\u06E1\u0633\u064E\u0647\u064F\u06E5\u06D7 \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 29, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646 \u062A\u064F\u062E\u06E1\u0641\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u062A\u064F\u0628\u06E1\u062F\u064F\u0648\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u06E1\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 30, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u062C\u0650\u062F\u064F \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0645\u0651\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u0645\u0651\u064F\u062D\u06E1\u0636\u064E\u0631\u0657\u0627 \u0648\u064E\u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0633\u064F\u0648\u0653\u0621\u0656 \u062A\u064E\u0648\u064E\u062F\u0651\u064F \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0645\u064E\u062F\u064E\u06E2\u0627 \u0628\u064E\u0639\u0650\u064A\u062F\u0657\u0627\u06D7 \u0648\u064E\u064A\u064F\u062D\u064E\u0630\u0651\u0650\u0631\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0646\u064E\u0641\u06E1\u0633\u064E\u0647\u064F\u06E5\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0621\u064F\u0648\u0641\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0639\u0650\u0628\u064E\u0627\u062F\u0650" }, { id: 31, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u0650\u064A \u064A\u064F\u062D\u06E1\u0628\u0650\u0628\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0630\u064F\u0646\u064F\u0648\u0628\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 32, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E\u06D6 \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0635\u06E1\u0637\u064E\u0641\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0648\u064E\u0646\u064F\u0648\u062D\u0657\u0627 \u0648\u064E\u0621\u064E\u0627\u0644\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0621\u064E\u0627\u0644\u064E \u0639\u0650\u0645\u06E1\u0631\u064E\u0670\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 34, text: "\u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u064E\u06E2 \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u0636\u0656\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 35, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064F \u0639\u0650\u0645\u06E1\u0631\u064E\u0670\u0646\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0646\u064E\u0630\u064E\u0631\u06E1\u062A\u064F \u0644\u064E\u0643\u064E \u0645\u064E\u0627 \u0641\u0650\u064A \u0628\u064E\u0637\u06E1\u0646\u0650\u064A \u0645\u064F\u062D\u064E\u0631\u0651\u064E\u0631\u0657\u0627 \u0641\u064E\u062A\u064E\u0642\u064E\u0628\u0651\u064E\u0644\u06E1 \u0645\u0650\u0646\u0651\u0650\u064A\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 36, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0648\u064E\u0636\u064E\u0639\u064E\u062A\u06E1\u0647\u064E\u0627 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0648\u064E\u0636\u064E\u0639\u06E1\u062A\u064F\u0647\u064E\u0627\u0653 \u0623\u064F\u0646\u062B\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u0648\u064E\u0636\u064E\u0639\u064E\u062A\u06E1 \u0648\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0671\u0644\u0630\u0651\u064E\u0643\u064E\u0631\u064F \u0643\u064E\u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u0649\u0670\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0633\u064E\u0645\u0651\u064E\u064A\u06E1\u062A\u064F\u0647\u064E\u0627 \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064F\u0639\u0650\u064A\u0630\u064F\u0647\u064E\u0627 \u0628\u0650\u0643\u064E \u0648\u064E\u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u064E\u0647\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u062C\u0650\u064A\u0645\u0650" }, { id: 37, text: "\u0641\u064E\u062A\u064E\u0642\u064E\u0628\u0651\u064E\u0644\u064E\u0647\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0647\u064E\u0627 \u0628\u0650\u0642\u064E\u0628\u064F\u0648\u0644\u064D \u062D\u064E\u0633\u064E\u0646\u0656 \u0648\u064E\u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u064E\u0647\u064E\u0627 \u0646\u064E\u0628\u064E\u0627\u062A\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627 \u0648\u064E\u0643\u064E\u0641\u0651\u064E\u0644\u064E\u0647\u064E\u0627 \u0632\u064E\u0643\u064E\u0631\u0650\u064A\u0651\u064E\u0627\u06D6 \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627 \u062F\u064E\u062E\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0632\u064E\u0643\u064E\u0631\u0650\u064A\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u0650\u062D\u06E1\u0631\u064E\u0627\u0628\u064E \u0648\u064E\u062C\u064E\u062F\u064E \u0639\u0650\u0646\u062F\u064E\u0647\u064E\u0627 \u0631\u0650\u0632\u06E1\u0642\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064F \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u0644\u064E\u0643\u0650 \u0647\u064E\u0670\u0630\u064E\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0647\u064F\u0648\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u0650\u0633\u064E\u0627\u0628\u064D" }, { id: 38, text: "\u0647\u064F\u0646\u064E\u0627\u0644\u0650\u0643\u064E \u062F\u064E\u0639\u064E\u0627 \u0632\u064E\u0643\u064E\u0631\u0650\u064A\u0651\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5\u06D6 \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0647\u064E\u0628\u06E1 \u0644\u0650\u064A \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0643\u064E \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u0657 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0629\u064B\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u062F\u0651\u064F\u0639\u064E\u0627\u0653\u0621\u0650" }, { id: 39, text: "\u0641\u064E\u0646\u064E\u0627\u062F\u064E\u062A\u06E1\u0647\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0648\u064E\u0647\u064F\u0648\u064E \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u065E \u064A\u064F\u0635\u064E\u0644\u0651\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u0650\u062D\u06E1\u0631\u064E\u0627\u0628\u0650 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064F\u0643\u064E \u0628\u0650\u064A\u064E\u062D\u06E1\u064A\u064E\u0649\u0670 \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u064E\u06E2\u0627 \u0628\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0633\u064E\u064A\u0651\u0650\u062F\u0657\u0627 \u0648\u064E\u062D\u064E\u0635\u064F\u0648\u0631\u0657\u0627 \u0648\u064E\u0646\u064E\u0628\u0650\u064A\u0651\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 40, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u0650\u064A \u063A\u064F\u0644\u064E\u0670\u0645\u065E \u0648\u064E\u0642\u064E\u062F\u06E1 \u0628\u064E\u0644\u064E\u063A\u064E\u0646\u0650\u064A\u064E \u0671\u0644\u06E1\u0643\u0650\u0628\u064E\u0631\u064F \u0648\u064E\u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u0650\u064A \u0639\u064E\u0627\u0642\u0650\u0631\u065E\u06D6 \u0642\u064E\u0627\u0644\u064E \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F" }, { id: 41, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u0657\u06D6 \u0642\u064E\u0627\u0644\u064E \u0621\u064E\u0627\u064A\u064E\u062A\u064F\u0643\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u064E \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u0645\u06E1\u0632\u0657\u0627\u06D7 \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631 \u0631\u0651\u064E\u0628\u0651\u064E\u0643\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0634\u0650\u064A\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0628\u06E1\u0643\u064E\u0670\u0631\u0650" }, { id: 42, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u064A\u064E\u0670\u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064F \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0635\u06E1\u0637\u064E\u0641\u064E\u0649\u0670\u0643\u0650 \u0648\u064E\u0637\u064E\u0647\u0651\u064E\u0631\u064E\u0643\u0650 \u0648\u064E\u0671\u0635\u06E1\u0637\u064E\u0641\u064E\u0649\u0670\u0643\u0650 \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 43, text: "\u064A\u064E\u0670\u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064F \u0671\u0642\u06E1\u0646\u064F\u062A\u0650\u064A \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u0650 \u0648\u064E\u0671\u0633\u06E1\u062C\u064F\u062F\u0650\u064A \u0648\u064E\u0671\u0631\u06E1\u0643\u064E\u0639\u0650\u064A \u0645\u064E\u0639\u064E \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0643\u0650\u0639\u0650\u064A\u0646\u064E" }, { id: 44, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0646\u064F\u0648\u062D\u0650\u064A\u0647\u0650 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u0644\u064E\u062F\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u064A\u064F\u0644\u06E1\u0642\u064F\u0648\u0646\u064E \u0623\u064E\u0642\u06E1\u0644\u064E\u0670\u0645\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u064A\u0651\u064F\u0647\u064F\u0645\u06E1 \u064A\u064E\u0643\u06E1\u0641\u064F\u0644\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u0644\u064E\u062F\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u064A\u064E\u062E\u06E1\u062A\u064E\u0635\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u064A\u064E\u0670\u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064F \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064F\u0643\u0650 \u0628\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0671\u0633\u06E1\u0645\u064F\u0647\u064F \u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064F \u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0648\u064E\u062C\u0650\u064A\u0647\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0631\u0651\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u064A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u0647\u06E1\u062F\u0650 \u0648\u064E\u0643\u064E\u0647\u06E1\u0644\u0657\u0627 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0631\u064E\u0628\u0651\u0650 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u0650\u064A \u0648\u064E\u0644\u064E\u062F\u065E \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0645\u06E1\u0633\u064E\u0633\u06E1\u0646\u0650\u064A \u0628\u064E\u0634\u064E\u0631\u065E\u06D6 \u0642\u064E\u0627\u0644\u064E \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0636\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0631\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u064E\u0647\u064F\u06E5 \u0643\u064F\u0646 \u0641\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F" }, { id: 48, text: "\u0648\u064E\u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0647\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u064E" }, { id: 49, text: "\u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0623\u064E\u0646\u0651\u0650\u064A \u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064F\u0643\u064F\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u0650\u064A\u0646\u0650 \u0643\u064E\u0647\u064E\u064A\u06E1\u0640\u0654\u064E\u0629\u0650 \u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u0650 \u0641\u064E\u0623\u064E\u0646\u0641\u064F\u062E\u064F \u0641\u0650\u064A\u0647\u0650 \u0641\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0637\u064E\u064A\u06E1\u0631\u064E\u06E2\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0623\u064F\u0628\u06E1\u0631\u0650\u0626\u064F \u0671\u0644\u06E1\u0623\u064E\u0643\u06E1\u0645\u064E\u0647\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0631\u064E\u0635\u064E \u0648\u064E\u0623\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0623\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u062F\u0651\u064E\u062E\u0650\u0631\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0628\u064F\u064A\u064F\u0648\u062A\u0650\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0648\u064E\u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u0650 \u0648\u064E\u0644\u0650\u0623\u064F\u062D\u0650\u0644\u0651\u064E \u0644\u064E\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062D\u064F\u0631\u0651\u0650\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u062C\u0650\u0626\u06E1\u062A\u064F\u0643\u064F\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 51, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0647\u064F\u06DA \u0647\u064E\u0670\u0630\u064E\u0627 \u0635\u0650\u0631\u064E\u0670\u0637\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u065E" }, { id: 52, text: "\u06DE\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062D\u064E\u0633\u0651\u064E \u0639\u0650\u064A\u0633\u064E\u0649\u0670 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u064E \u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0646\u06E1 \u0623\u064E\u0646\u0635\u064E\u0627\u0631\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u062D\u064E\u0648\u064E\u0627\u0631\u0650\u064A\u0651\u064F\u0648\u0646\u064E \u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0646\u0635\u064E\u0627\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0634\u06E1\u0647\u064E\u062F\u06E1 \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0627 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u062A\u064E \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u06E1\u0646\u064E\u0627 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0641\u064E\u0671\u0643\u06E1\u062A\u064F\u0628\u06E1\u0646\u064E\u0627 \u0645\u064E\u0639\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u0648\u064E\u0645\u064E\u0643\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0643\u064E\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u0645\u064E\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 55, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0670\u0639\u0650\u064A\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064F\u062A\u064E\u0648\u064E\u0641\u0651\u0650\u064A\u0643\u064E \u0648\u064E\u0631\u064E\u0627\u0641\u0650\u0639\u064F\u0643\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0648\u064E\u0645\u064F\u0637\u064E\u0647\u0651\u0650\u0631\u064F\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u0627\u0639\u0650\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0643\u064E \u0641\u064E\u0648\u06E1\u0642\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06D6 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u062A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0640\u0670\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 57, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0641\u064E\u064A\u064F\u0648\u064E\u0641\u0651\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 58, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062A\u06E1\u0644\u064F\u0648\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u0650" }, { id: 59, text: "\u0625\u0650\u0646\u0651\u064E \u0645\u064E\u062B\u064E\u0644\u064E \u0639\u0650\u064A\u0633\u064E\u0649\u0670 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u0621\u064E\u0627\u062F\u064E\u0645\u064E\u06D6 \u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u062A\u064F\u0631\u064E\u0627\u0628\u0656 \u062B\u064F\u0645\u0651\u064E \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u06E5 \u0643\u064F\u0646 \u0641\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F" }, { id: 60, text: "\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0645\u06E1\u062A\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 61, text: "\u0641\u064E\u0645\u064E\u0646\u06E1 \u062D\u064E\u0627\u0653\u062C\u0651\u064E\u0643\u064E \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u0641\u064E\u0642\u064F\u0644\u06E1 \u062A\u064E\u0639\u064E\u0627\u0644\u064E\u0648\u06E1\u0627\u0652 \u0646\u064E\u062F\u06E1\u0639\u064F \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0646\u0650\u0633\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0648\u064E\u0646\u0650\u0633\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0646\u064E\u0628\u06E1\u062A\u064E\u0647\u0650\u0644\u06E1 \u0641\u064E\u0646\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0639\u06E1\u0646\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 62, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0642\u064E\u0635\u064E\u0635\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06DA \u0648\u064E\u0645\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 63, text: "\u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 64, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u062A\u064E\u0639\u064E\u0627\u0644\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u0656 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0650\u06ED \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0644\u0651\u064E\u0627 \u0646\u064E\u0639\u06E1\u0628\u064F\u062F\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0644\u064E\u0627 \u0646\u064F\u0634\u06E1\u0631\u0650\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064B\u0627 \u0623\u064E\u0631\u06E1\u0628\u064E\u0627\u0628\u0657\u0627 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0671\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0627 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u0650\u0645\u064E \u062A\u064F\u062D\u064E\u0627\u0653\u062C\u0651\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E\u062A\u0650 \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u064F \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6\u0653\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0647\u064E\u0640\u0670\u0653\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u062D\u064E\u0670\u062C\u064E\u062C\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u065E \u0641\u064E\u0644\u0650\u0645\u064E \u062A\u064F\u062D\u064E\u0627\u0653\u062C\u0651\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0645\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u065E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064F \u064A\u064E\u0647\u064F\u0648\u062F\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u06E1\u0631\u064E\u0627\u0646\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u062D\u064E\u0646\u0650\u064A\u0641\u0657\u0627 \u0645\u0651\u064F\u0633\u06E1\u0644\u0650\u0645\u0657\u0627 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 68, text: "\u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u0650\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0644\u064E\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0647\u064F \u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 69, text: "\u0648\u064E\u062F\u0651\u064E\u062A \u0637\u0651\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0648\u06E1 \u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u0650\u0645\u064E \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u0650\u0645\u064E \u062A\u064E\u0644\u06E1\u0628\u0650\u0633\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u0648\u064E\u062A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A \u0637\u0651\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u06E1\u0647\u064E \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u0671\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u062E\u0650\u0631\u064E\u0647\u064F\u06E5 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u0645\u064E\u0646 \u062A\u064E\u0628\u0650\u0639\u064E \u062F\u0650\u064A\u0646\u064E\u0643\u064F\u0645\u06E1 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0647\u064F\u062F\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646 \u064A\u064F\u0624\u06E1\u062A\u064E\u0649\u0670\u0653 \u0623\u064E\u062D\u064E\u062F\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064E \u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u062A\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u064A\u064F\u062D\u064E\u0627\u0653\u062C\u0651\u064F\u0648\u0643\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06D7 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u064E \u0628\u0650\u064A\u064E\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u0647\u0650 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0670\u0633\u0650\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 74, text: "\u064A\u064E\u062E\u06E1\u062A\u064E\u0635\u0651\u064F \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0630\u064F\u0648 \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 75, text: "\u06DE\u0648\u064E\u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u064E\u0646\u06E1 \u0625\u0650\u0646 \u062A\u064E\u0623\u06E1\u0645\u064E\u0646\u06E1\u0647\u064F \u0628\u0650\u0642\u0650\u0646\u0637\u064E\u0627\u0631\u0656 \u064A\u064F\u0624\u064E\u062F\u0651\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0625\u0650\u0646 \u062A\u064E\u0623\u06E1\u0645\u064E\u0646\u06E1\u0647\u064F \u0628\u0650\u062F\u0650\u064A\u0646\u064E\u0627\u0631\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u064E\u062F\u0651\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u062F\u064F\u0645\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u0657\u0627\u06D7 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064F\u0645\u0651\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u065E \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0628\u064E\u0644\u064E\u0649\u0670\u06DA \u0645\u064E\u0646\u06E1 \u0623\u064E\u0648\u06E1\u0641\u064E\u0649\u0670 \u0628\u0650\u0639\u064E\u0647\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064E\u0649\u0670 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 77, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0634\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0639\u064E\u0647\u06E1\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u062B\u064E\u0645\u064E\u0646\u0657\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0627 \u062E\u064E\u0644\u064E\u0670\u0642\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0646\u0638\u064F\u0631\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0632\u064E\u0643\u0651\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 78, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u064E\u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u064A\u064E\u0644\u06E1\u0648\u064F\u06E5\u0646\u064E \u0623\u064E\u0644\u06E1\u0633\u0650\u0646\u064E\u062A\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u0650\u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0647\u064F\u0648\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 79, text: "\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0628\u064E\u0634\u064E\u0631\u064D \u0623\u064E\u0646 \u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064F\u0628\u064F\u0648\u0651\u064E\u0629\u064E \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0639\u0650\u0628\u064E\u0627\u062F\u0657\u0627 \u0644\u0651\u0650\u064A \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0640\u0670\u0646\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u062F\u06E1\u0631\u064F\u0633\u064F\u0648\u0646\u064E" }, { id: 80, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0623\u064E\u0631\u06E1\u0628\u064E\u0627\u0628\u064B\u0627\u06DA \u0623\u064E\u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u0650 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0630\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0644\u064E\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0648\u064E\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0645\u0651\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u065E \u0644\u0651\u0650\u0645\u064E\u0627 \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0646\u0651\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u062A\u064E\u0646\u0635\u064F\u0631\u064F\u0646\u0651\u064E\u0647\u064F\u06E5\u06DA \u0642\u064E\u0627\u0644\u064E \u0621\u064E\u0623\u064E\u0642\u06E1\u0631\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0635\u06E1\u0631\u0650\u064A\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0642\u06E1\u0631\u064E\u0631\u06E1\u0646\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0671\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0645\u064E\u0639\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 82, text: "\u0641\u064E\u0645\u064E\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0623\u064E\u0641\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u062F\u0650\u064A\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u064E \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0637\u064E\u0648\u06E1\u0639\u0657\u0627 \u0648\u064E\u0643\u064E\u0631\u06E1\u0647\u0657\u0627 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 84, text: "\u0642\u064F\u0644\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0628\u064E\u0627\u0637\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0639\u0650\u064A\u0633\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0627 \u0646\u064F\u0641\u064E\u0631\u0651\u0650\u0642\u064F \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 85, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0628\u06E1\u062A\u064E\u063A\u0650 \u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u06E1\u0625\u0650\u0633\u06E1\u0644\u064E\u0670\u0645\u0650 \u062F\u0650\u064A\u0646\u0657\u0627 \u0641\u064E\u0644\u064E\u0646 \u064A\u064F\u0642\u06E1\u0628\u064E\u0644\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 86, text: "\u0643\u064E\u064A\u06E1\u0641\u064E \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0634\u064E\u0647\u0650\u062F\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u062D\u064E\u0642\u0651\u065E \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 87, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0644\u064E\u0639\u06E1\u0646\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 88, text: "\u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064E\u0627 \u064A\u064F\u062E\u064E\u0641\u0651\u064E\u0641\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0638\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 89, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 90, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0671\u0632\u06E1\u062F\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0643\u064F\u0641\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0646 \u062A\u064F\u0642\u06E1\u0628\u064E\u0644\u064E \u062A\u064E\u0648\u06E1\u0628\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0636\u0651\u064E\u0627\u0653\u0644\u0651\u064F\u0648\u0646\u064E" }, { id: 91, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0643\u064F\u0641\u0651\u064E\u0627\u0631\u065E \u0641\u064E\u0644\u064E\u0646 \u064A\u064F\u0642\u06E1\u0628\u064E\u0644\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0644\u06E1\u0621\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0630\u064E\u0647\u064E\u0628\u0657\u0627 \u0648\u064E\u0644\u064E\u0648\u0650 \u0671\u0641\u06E1\u062A\u064E\u062F\u064E\u0649\u0670 \u0628\u0650\u0647\u0650\u06E6\u0653\u06D7 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0640\u0670\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 92, text: "\u0644\u064E\u0646 \u062A\u064E\u0646\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0628\u0650\u0631\u0651\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 93, text: "\u06DE\u0643\u064F\u0644\u0651\u064F \u0671\u0644\u0637\u0651\u064E\u0639\u064E\u0627\u0645\u0650 \u0643\u064E\u0627\u0646\u064E \u062D\u0650\u0644\u0651\u0657\u0627 \u0644\u0651\u0650\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u062A\u064F\u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u064F\u06DA \u0642\u064F\u0644\u06E1 \u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u0650 \u0641\u064E\u0671\u062A\u06E1\u0644\u064F\u0648\u0647\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 94, text: "\u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 95, text: "\u0642\u064F\u0644\u06E1 \u0635\u064E\u062F\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0641\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0645\u0650\u0644\u0651\u064E\u0629\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u062D\u064E\u0646\u0650\u064A\u0641\u0657\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 96, text: "\u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0628\u064E\u064A\u06E1\u062A\u0656 \u0648\u064F\u0636\u0650\u0639\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u0650\u0628\u064E\u0643\u0651\u064E\u0629\u064E \u0645\u064F\u0628\u064E\u0627\u0631\u064E\u0643\u0657\u0627 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 97, text: "\u0641\u0650\u064A\u0647\u0650 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u06E2 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u065E \u0645\u0651\u064E\u0642\u064E\u0627\u0645\u064F \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E\u06D6 \u0648\u064E\u0645\u064E\u0646 \u062F\u064E\u062E\u064E\u0644\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0621\u064E\u0627\u0645\u0650\u0646\u0657\u0627\u06D7 \u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u062D\u0650\u062C\u0651\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u0650 \u0645\u064E\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0627\u0639\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0646\u0650\u064A\u0651\u064C \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 98, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u0650\u0645\u064E \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0634\u064E\u0647\u0650\u064A\u062F\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 99, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u0650\u0645\u064E \u062A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u062A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0639\u0650\u0648\u064E\u062C\u0657\u0627 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u063A\u064E\u0670\u0641\u0650\u0644\u064D \u0639\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 100, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u062A\u064F\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u064A\u064E\u0631\u064F\u062F\u0651\u064F\u0648\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 101, text: "\u0648\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u062A\u064E\u0635\u0650\u0645 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0647\u064F\u062F\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 102, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062D\u064E\u0642\u0651\u064E \u062A\u064F\u0642\u064E\u0627\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u064F\u0648\u062A\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 103, text: "\u0648\u064E\u0671\u0639\u06E1\u062A\u064E\u0635\u0650\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u062D\u064E\u0628\u06E1\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0641\u064E\u0631\u0651\u064E\u0642\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u062F\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u0644\u0651\u064E\u0641\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u06E1\u062A\u064F\u0645 \u0628\u0650\u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u0641\u064E\u0627 \u062D\u064F\u0641\u06E1\u0631\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0641\u064E\u0623\u064E\u0646\u0642\u064E\u0630\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627\u06D7 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 104, text: "\u0648\u064E\u0644\u06E1\u062A\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u065E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650 \u0648\u064E\u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0648\u064E\u064A\u064E\u0646\u06E1\u0647\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650\u06DA \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 105, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0641\u064E\u0631\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u064F\u06DA \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 106, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0628\u06E1\u064A\u064E\u0636\u0651\u064F \u0648\u064F\u062C\u064F\u0648\u0647\u065E \u0648\u064E\u062A\u064E\u0633\u06E1\u0648\u064E\u062F\u0651\u064F \u0648\u064F\u062C\u064F\u0648\u0647\u065E\u06DA \u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u0648\u064E\u062F\u0651\u064E\u062A\u06E1 \u0648\u064F\u062C\u064F\u0648\u0647\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0643\u064E\u0641\u064E\u0631\u06E1\u062A\u064F\u0645 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 107, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0628\u06E1\u064A\u064E\u0636\u0651\u064E\u062A\u06E1 \u0648\u064F\u062C\u064F\u0648\u0647\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 108, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0646\u064E\u062A\u06E1\u0644\u064F\u0648\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0638\u064F\u0644\u06E1\u0645\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 109, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u064F" }, { id: 110, text: "\u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u064E \u0623\u064F\u0645\u0651\u064E\u0629\u064D \u0623\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u062A\u06E1 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u062A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0648\u064E\u062A\u064E\u0646\u06E1\u0647\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650 \u0648\u064E\u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0623\u064E\u0647\u06E1\u0644\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0643\u064E\u0627\u0646\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u0645\u06DA \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0648\u064E\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 111, text: "\u0644\u064E\u0646 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0648\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0630\u0657\u0649\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0643\u064F\u0645\u06E1 \u064A\u064F\u0648\u064E\u0644\u0651\u064F\u0648\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u062F\u06E1\u0628\u064E\u0627\u0631\u064E \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 112, text: "\u0636\u064F\u0631\u0650\u0628\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0630\u0651\u0650\u0644\u0651\u064E\u0629\u064F \u0623\u064E\u064A\u06E1\u0646\u064E \u0645\u064E\u0627 \u062B\u064F\u0642\u0650\u0641\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u062D\u064E\u0628\u06E1\u0644\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u062D\u064E\u0628\u06E1\u0644\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0628\u064E\u0627\u0653\u0621\u064F\u0648 \u0628\u0650\u063A\u064E\u0636\u064E\u0628\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0636\u064F\u0631\u0650\u0628\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u0643\u064E\u0646\u064E\u0629\u064F\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0646\u06E2\u0628\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u064E\u0642\u0651\u0656\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0635\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 113, text: "\u06DE\u0644\u064E\u064A\u06E1\u0633\u064F\u0648\u0627\u0652 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0657\u06D7 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u065E \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u064E\u0629\u065E \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0646\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0621\u064E\u0627\u0646\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 114, text: "\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0648\u064E\u064A\u064E\u0646\u06E1\u0647\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650 \u0648\u064E\u064A\u064F\u0633\u064E\u0670\u0631\u0650\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064E\u0670\u062A\u0650\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 115, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u0641\u064E\u0644\u064E\u0646 \u064A\u064F\u0643\u06E1\u0641\u064E\u0631\u064F\u0648\u0647\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 116, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u062A\u064F\u063A\u06E1\u0646\u0650\u064A\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 117, text: "\u0645\u064E\u062B\u064E\u0644\u064F \u0645\u064E\u0627 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u0631\u0650\u064A\u062D\u0656 \u0641\u0650\u064A\u0647\u064E\u0627 \u0635\u0650\u0631\u0651\u064C \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u062A\u06E1 \u062D\u064E\u0631\u06E1\u062B\u064E \u0642\u064E\u0648\u06E1\u0645\u0656 \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u064E\u062A\u06E1\u0647\u064F\u06DA \u0648\u064E\u0645\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 118, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0628\u0650\u0637\u064E\u0627\u0646\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u0644\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u062E\u064E\u0628\u064E\u0627\u0644\u0657\u0627 \u0648\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0639\u064E\u0646\u0650\u062A\u0651\u064F\u0645\u06E1 \u0642\u064E\u062F\u06E1 \u0628\u064E\u062F\u064E\u062A\u0650 \u0671\u0644\u06E1\u0628\u064E\u063A\u06E1\u0636\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u062E\u06E1\u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u06DA \u0642\u064E\u062F\u06E1 \u0628\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650\u06D6 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 119, text: "\u0647\u064E\u0640\u0670\u0653\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064F\u0648\u0652\u0644\u064E\u0627\u0653\u0621\u0650 \u062A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0643\u064F\u0644\u0651\u0650\u0647\u0650\u06E6 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0644\u064E\u0642\u064F\u0648\u0643\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062E\u064E\u0644\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0636\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u064E\u0627\u0645\u0650\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0638\u0650\u06DA \u0642\u064F\u0644\u06E1 \u0645\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u063A\u064E\u064A\u06E1\u0638\u0650\u0643\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 120, text: "\u0625\u0650\u0646 \u062A\u064E\u0645\u06E1\u0633\u064E\u0633\u06E1\u0643\u064F\u0645\u06E1 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u065E \u062A\u064E\u0633\u064F\u0624\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0635\u0650\u0628\u06E1\u0643\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u065E \u064A\u064E\u0641\u06E1\u0631\u064E\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0643\u064F\u0645\u06E1 \u0643\u064E\u064A\u06E1\u062F\u064F\u0647\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0645\u064F\u062D\u0650\u064A\u0637\u065E" }, { id: 121, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u063A\u064E\u062F\u064E\u0648\u06E1\u062A\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650\u0643\u064E \u062A\u064F\u0628\u064E\u0648\u0651\u0650\u0626\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0645\u064E\u0642\u064E\u0670\u0639\u0650\u062F\u064E \u0644\u0650\u0644\u06E1\u0642\u0650\u062A\u064E\u0627\u0644\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 122, text: "\u0625\u0650\u0630\u06E1 \u0647\u064E\u0645\u0651\u064E\u062A \u0637\u0651\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u062A\u064E\u0627\u0646\u0650 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0641\u06E1\u0634\u064E\u0644\u064E\u0627 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u0650\u064A\u0651\u064F\u0647\u064F\u0645\u064E\u0627\u06D7 \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 123, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0646\u064E\u0635\u064E\u0631\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0628\u064E\u062F\u06E1\u0631\u0656 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0630\u0650\u0644\u0651\u064E\u0629\u065E\u06D6 \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 124, text: "\u0625\u0650\u0630\u06E1 \u062A\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0623\u064E\u0644\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u0650\u064A\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064F\u0645\u0650\u062F\u0651\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645 \u0628\u0650\u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u0650 \u0621\u064E\u0627\u0644\u064E\u0670\u0641\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0645\u064F\u0646\u0632\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 125, text: "\u0628\u064E\u0644\u064E\u0649\u0670\u0653\u06DA \u0625\u0650\u0646 \u062A\u064E\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0648\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u064A\u064F\u0645\u06E1\u062F\u0650\u062F\u06E1\u0643\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645 \u0628\u0650\u062E\u064E\u0645\u06E1\u0633\u064E\u0629\u0650 \u0621\u064E\u0627\u0644\u064E\u0670\u0641\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0645\u064F\u0633\u064E\u0648\u0651\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 126, text: "\u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u062A\u064E\u0637\u06E1\u0645\u064E\u0626\u0650\u0646\u0651\u064E \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0635\u06E1\u0631\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u0650" }, { id: 127, text: "\u0644\u0650\u064A\u064E\u0642\u06E1\u0637\u064E\u0639\u064E \u0637\u064E\u0631\u064E\u0641\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1 \u064A\u064E\u0643\u06E1\u0628\u0650\u062A\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u064A\u064E\u0646\u0642\u064E\u0644\u0650\u0628\u064F\u0648\u0627\u0652 \u062E\u064E\u0627\u0653\u0626\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 128, text: "\u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650 \u0634\u064E\u064A\u06E1\u0621\u064C \u0623\u064E\u0648\u06E1 \u064A\u064E\u062A\u064F\u0648\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0638\u064E\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 129, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 130, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u0650\u0628\u064E\u0648\u0670\u0653\u0627\u0652 \u0623\u064E\u0636\u06E1\u0639\u064E\u0670\u0641\u0657\u0627 \u0645\u0651\u064F\u0636\u064E\u0670\u0639\u064E\u0641\u064E\u0629\u0657\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 131, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064F\u0639\u0650\u062F\u0651\u064E\u062A\u06E1 \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 132, text: "\u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0631\u06E1\u062D\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 133, text: "\u06DE\u0648\u064E\u0633\u064E\u0627\u0631\u0650\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u062C\u064E\u0646\u0651\u064E\u0629\u064D \u0639\u064E\u0631\u06E1\u0636\u064F\u0647\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0623\u064F\u0639\u0650\u062F\u0651\u064E\u062A\u06E1 \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 134, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u0636\u0651\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0643\u064E\u0670\u0638\u0650\u0645\u0650\u064A\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0638\u064E \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0627\u0641\u0650\u064A\u0646\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 135, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0630\u064E\u0643\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0671\u0644\u0630\u0651\u064F\u0646\u064F\u0648\u0628\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0635\u0650\u0631\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 136, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u065E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0648\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u0623\u064E\u062C\u06E1\u0631\u064F \u0671\u0644\u06E1\u0639\u064E\u0670\u0645\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 137, text: "\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0633\u064F\u0646\u064E\u0646\u065E \u0641\u064E\u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 138, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u064E\u064A\u064E\u0627\u0646\u065E \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0645\u064E\u0648\u06E1\u0639\u0650\u0638\u064E\u0629\u065E \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 139, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0647\u0650\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 140, text: "\u0625\u0650\u0646 \u064A\u064E\u0645\u06E1\u0633\u064E\u0633\u06E1\u0643\u064F\u0645\u06E1 \u0642\u064E\u0631\u06E1\u062D\u065E \u0641\u064E\u0642\u064E\u062F\u06E1 \u0645\u064E\u0633\u0651\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0642\u064E\u0631\u06E1\u062D\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0647\u064F\u06E5\u06DA \u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u064A\u0651\u064E\u0627\u0645\u064F \u0646\u064F\u062F\u064E\u0627\u0648\u0650\u0644\u064F\u0647\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 141, text: "\u0648\u064E\u0644\u0650\u064A\u064F\u0645\u064E\u062D\u0651\u0650\u0635\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u0645\u06E1\u062D\u064E\u0642\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 142, text: "\u0623\u064E\u0645\u06E1 \u062D\u064E\u0633\u0650\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 143, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0645\u064E\u0646\u0651\u064E\u0648\u06E1\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u062A\u064E\u0644\u06E1\u0642\u064E\u0648\u06E1\u0647\u064F \u0641\u064E\u0642\u064E\u062F\u06E1 \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 144, text: "\u0648\u064E\u0645\u064E\u0627 \u0645\u064F\u062D\u064E\u0645\u0651\u064E\u062F\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650 \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064F\u06DA \u0623\u064E\u0641\u064E\u0625\u0650\u064A\u0652\u0646 \u0645\u0651\u064E\u0627\u062A\u064E \u0623\u064E\u0648\u06E1 \u0642\u064F\u062A\u0650\u0644\u064E \u0671\u0646\u0642\u064E\u0644\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0639\u06E1\u0642\u064E\u0670\u0628\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0646\u0642\u064E\u0644\u0650\u0628\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u0642\u0650\u0628\u064E\u064A\u06E1\u0647\u0650 \u0641\u064E\u0644\u064E\u0646 \u064A\u064E\u0636\u064F\u0631\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06DA \u0648\u064E\u0633\u064E\u064A\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 145, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u064D \u0623\u064E\u0646 \u062A\u064E\u0645\u064F\u0648\u062A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627 \u0645\u0651\u064F\u0624\u064E\u062C\u0651\u064E\u0644\u0657\u0627\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0631\u0650\u062F\u06E1 \u062B\u064E\u0648\u064E\u0627\u0628\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0646\u064F\u0624\u06E1\u062A\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0631\u0650\u062F\u06E1 \u062B\u064E\u0648\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0646\u064F\u0624\u06E1\u062A\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u06DA \u0648\u064E\u0633\u064E\u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 146, text: "\u0648\u064E\u0643\u064E\u0623\u064E\u064A\u0651\u0650\u0646 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0656 \u0642\u064E\u0670\u062A\u064E\u0644\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0631\u0650\u0628\u0651\u0650\u064A\u0651\u064F\u0648\u0646\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u065E \u0641\u064E\u0645\u064E\u0627 \u0648\u064E\u0647\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627 \u0636\u064E\u0639\u064F\u0641\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 147, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0642\u064E\u0648\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0630\u064F\u0646\u064F\u0648\u0628\u064E\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0633\u06E1\u0631\u064E\u0627\u0641\u064E\u0646\u064E\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1\u0631\u0650\u0646\u064E\u0627 \u0648\u064E\u062B\u064E\u0628\u0651\u0650\u062A\u06E1 \u0623\u064E\u0642\u06E1\u062F\u064E\u0627\u0645\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u0646\u0635\u064F\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 148, text: "\u0641\u064E\u0640\u0654\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062B\u064E\u0648\u064E\u0627\u0628\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u062D\u064F\u0633\u06E1\u0646\u064E \u062B\u064E\u0648\u064E\u0627\u0628\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 149, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u062A\u064F\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u064A\u064E\u0631\u064F\u062F\u0651\u064F\u0648\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0639\u06E1\u0642\u064E\u0670\u0628\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u062A\u064E\u0646\u0642\u064E\u0644\u0650\u0628\u064F\u0648\u0627\u0652 \u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 150, text: "\u0628\u064E\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0646\u0651\u064E\u0640\u0670\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 151, text: "\u0633\u064E\u0646\u064F\u0644\u06E1\u0642\u0650\u064A \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064F\u0639\u06E1\u0628\u064E \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627\u06D6 \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u062B\u06E1\u0648\u064E\u0649 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 152, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0635\u064E\u062F\u064E\u0642\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0639\u06E1\u062F\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0630\u06E1 \u062A\u064E\u062D\u064F\u0633\u0651\u064F\u0648\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u0647\u0650\u06E6\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0641\u064E\u0634\u0650\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u062A\u064E\u0646\u064E\u0670\u0632\u064E\u0639\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650 \u0648\u064E\u0639\u064E\u0635\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u0649\u0670\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u062A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E\u06DA \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E\u06DA \u062B\u064F\u0645\u0651\u064E \u0635\u064E\u0631\u064E\u0641\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u0628\u06E1\u062A\u064E\u0644\u0650\u064A\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0641\u064E\u0627 \u0639\u064E\u0646\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0630\u064F\u0648 \u0641\u064E\u0636\u06E1\u0644\u064D \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 153, text: "\u06DE\u0625\u0650\u0630\u06E1 \u062A\u064F\u0635\u06E1\u0639\u0650\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0644\u06E1\u0648\u064F\u06E5\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062D\u064E\u062F\u0656 \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u062B\u064E\u0670\u0628\u064E\u0643\u064F\u0645\u06E1 \u063A\u064E\u0645\u0651\u064E\u06E2\u0627 \u0628\u0650\u063A\u064E\u0645\u0651\u0656 \u0644\u0651\u0650\u0643\u064E\u064A\u06E1\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0641\u064E\u0627\u062A\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0670\u0628\u064E\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 154, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0671\u0644\u06E1\u063A\u064E\u0645\u0651\u0650 \u0623\u064E\u0645\u064E\u0646\u064E\u0629\u0657 \u0646\u0651\u064F\u0639\u064E\u0627\u0633\u0657\u0627 \u064A\u064E\u063A\u06E1\u0634\u064E\u0649\u0670 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0642\u064E\u062F\u06E1 \u0623\u064E\u0647\u064E\u0645\u0651\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0647\u064F\u0645\u06E1 \u064A\u064E\u0638\u064F\u0646\u0651\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0638\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u0650\u064A\u0651\u064E\u0629\u0650\u06D6 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0647\u064E\u0644 \u0644\u0651\u064E\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06D7 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064E \u0643\u064F\u0644\u0651\u064E\u0647\u064F\u06E5 \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06D7 \u064A\u064F\u062E\u06E1\u0641\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0644\u064E\u0627 \u064A\u064F\u0628\u06E1\u062F\u064F\u0648\u0646\u064E \u0644\u064E\u0643\u064E\u06D6 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650 \u0634\u064E\u064A\u06E1\u0621\u065E \u0645\u0651\u064E\u0627 \u0642\u064F\u062A\u0650\u0644\u06E1\u0646\u064E\u0627 \u0647\u064E\u0670\u0647\u064F\u0646\u064E\u0627\u06D7 \u0642\u064F\u0644 \u0644\u0651\u064E\u0648\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0628\u064F\u064A\u064F\u0648\u062A\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0628\u064E\u0631\u064E\u0632\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064F\u062A\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u062A\u06E1\u0644\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0636\u064E\u0627\u062C\u0650\u0639\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0644\u0650\u064A\u064E\u0628\u06E1\u062A\u064E\u0644\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u064A\u064F\u0645\u064E\u062D\u0651\u0650\u0635\u064E \u0645\u064E\u0627 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 155, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u062A\u064E\u0642\u064E\u0649 \u0671\u0644\u06E1\u062C\u064E\u0645\u06E1\u0639\u064E\u0627\u0646\u0650 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0632\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0650 \u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0641\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u064C \u062D\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 156, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0636\u064E\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u063A\u064F\u0632\u0651\u0657\u0649 \u0644\u0651\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0639\u0650\u0646\u062F\u064E\u0646\u064E\u0627 \u0645\u064E\u0627 \u0645\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627 \u0642\u064F\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062D\u064E\u0633\u06E1\u0631\u064E\u0629\u0657 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u064A\u064F\u0645\u0650\u064A\u062A\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 157, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0642\u064F\u062A\u0650\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0648\u06E1 \u0645\u064F\u062A\u0651\u064F\u0645\u06E1 \u0644\u064E\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u064C \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 158, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0645\u0651\u064F\u062A\u0651\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0642\u064F\u062A\u0650\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 159, text: "\u0641\u064E\u0628\u0650\u0645\u064E\u0627 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u0650\u0646\u062A\u064E \u0644\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064F\u0646\u062A\u064E \u0641\u064E\u0638\u0651\u064B\u0627 \u063A\u064E\u0644\u0650\u064A\u0638\u064E \u0671\u0644\u06E1\u0642\u064E\u0644\u06E1\u0628\u0650 \u0644\u064E\u0671\u0646\u0641\u064E\u0636\u0651\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062D\u064E\u0648\u06E1\u0644\u0650\u0643\u064E\u06D6 \u0641\u064E\u0671\u0639\u06E1\u0641\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0634\u064E\u0627\u0648\u0650\u0631\u06E1\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0639\u064E\u0632\u064E\u0645\u06E1\u062A\u064E \u0641\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0648\u064E\u0643\u0651\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 160, text: "\u0625\u0650\u0646 \u064A\u064E\u0646\u0635\u064F\u0631\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0644\u064E\u0627 \u063A\u064E\u0627\u0644\u0650\u0628\u064E \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u062E\u06E1\u0630\u064F\u0644\u06E1\u0643\u064F\u0645\u06E1 \u0641\u064E\u0645\u064E\u0646 \u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 161, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0646\u064E\u0628\u0650\u064A\u0651\u064D \u0623\u064E\u0646 \u064A\u064E\u063A\u064F\u0644\u0651\u064E\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u063A\u06E1\u0644\u064F\u0644\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u0645\u064E\u0627 \u063A\u064E\u0644\u0651\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06DA \u062B\u064F\u0645\u0651\u064E \u062A\u064F\u0648\u064E\u0641\u0651\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 162, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0645\u064E\u0646\u06E2 \u0628\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0633\u064E\u062E\u064E\u0637\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 163, text: "\u0647\u064F\u0645\u06E1 \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u064C \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u0635\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 164, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0645\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u06E1 \u0628\u064E\u0639\u064E\u062B\u064E \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0632\u064E\u0643\u0651\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0644\u064E\u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 165, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0670\u0628\u064E\u062A\u06E1\u0643\u064F\u0645 \u0645\u0651\u064F\u0635\u0650\u064A\u0628\u064E\u0629\u065E \u0642\u064E\u062F\u06E1 \u0623\u064E\u0635\u064E\u0628\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u062B\u06E1\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0642\u064F\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u0647\u064E\u0670\u0630\u064E\u0627\u06D6 \u0642\u064F\u0644\u06E1 \u0647\u064F\u0648\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 166, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0670\u0628\u064E\u0643\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u062A\u064E\u0642\u064E\u0649 \u0671\u0644\u06E1\u062C\u064E\u0645\u06E1\u0639\u064E\u0627\u0646\u0650 \u0641\u064E\u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 167, text: "\u0648\u064E\u0644\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0646\u064E\u0627\u0641\u064E\u0642\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062A\u064E\u0639\u064E\u0627\u0644\u064E\u0648\u06E1\u0627\u0652 \u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0648\u0650 \u0671\u062F\u06E1\u0641\u064E\u0639\u064F\u0648\u0627\u0652\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0642\u0650\u062A\u064E\u0627\u0644\u0657\u0627 \u0644\u0651\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1\u06D7 \u0647\u064F\u0645\u06E1 \u0644\u0650\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u0650\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u06DA \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 168, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0642\u064E\u0639\u064E\u062F\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0623\u064E\u0637\u064E\u0627\u0639\u064F\u0648\u0646\u064E\u0627 \u0645\u064E\u0627 \u0642\u064F\u062A\u0650\u0644\u064F\u0648\u0627\u0652\u06D7 \u0642\u064F\u0644\u06E1 \u0641\u064E\u0671\u062F\u06E1\u0631\u064E\u0621\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 169, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064F\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u062A\u064E\u06E2\u0627\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u062D\u06E1\u064A\u064E\u0627\u0653\u0621\u064C \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u0631\u06E1\u0632\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 170, text: "\u0641\u064E\u0631\u0650\u062D\u0650\u064A\u0646\u064E \u0628\u0650\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u0628\u06E1\u0634\u0650\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0644\u06E1\u062D\u064E\u0642\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0644\u0651\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 171, text: "\u06DE\u064A\u064E\u0633\u06E1\u062A\u064E\u0628\u06E1\u0634\u0650\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0641\u064E\u0636\u06E1\u0644\u0656 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u0636\u0650\u064A\u0639\u064F \u0623\u064E\u062C\u06E1\u0631\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 172, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u062D\u064F\u06DA \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u062C\u06E1\u0631\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u064C" }, { id: 173, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0642\u064E\u062F\u06E1 \u062C\u064E\u0645\u064E\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u062E\u06E1\u0634\u064E\u0648\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0632\u064E\u0627\u062F\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062D\u064E\u0633\u06E1\u0628\u064F\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u06E1\u0648\u064E\u0643\u0650\u064A\u0644\u064F" }, { id: 174, text: "\u0641\u064E\u0671\u0646\u0642\u064E\u0644\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0641\u064E\u0636\u06E1\u0644\u0656 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0645\u06E1\u0633\u064E\u0633\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u065E \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0630\u064F\u0648 \u0641\u064E\u0636\u06E1\u0644\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u064D" }, { id: 175, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u064A\u064F\u062E\u064E\u0648\u0651\u0650\u0641\u064F \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u06E5 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 176, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0632\u064F\u0646\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0633\u064E\u0670\u0631\u0650\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0646 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06DA \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0644\u0651\u064E\u0627 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u0638\u0651\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u064C" }, { id: 177, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0634\u06E1\u062A\u064E\u0631\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u064E \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650 \u0644\u064E\u0646 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 178, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u0646\u064F\u0645\u06E1\u0644\u0650\u064A \u0644\u064E\u0647\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0646\u064F\u0645\u06E1\u0644\u0650\u064A \u0644\u064E\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u0632\u06E1\u062F\u064E\u0627\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u062B\u06E1\u0645\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u065E" }, { id: 179, text: "\u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064E\u0630\u064E\u0631\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0645\u0650\u064A\u0632\u064E \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u0650\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064F\u0637\u06E1\u0644\u0650\u0639\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062C\u06E1\u062A\u064E\u0628\u0650\u064A \u0645\u0650\u0646 \u0631\u0651\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0641\u064E\u0640\u0654\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 180, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0628\u06E1\u062E\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u0645\u06D6 \u0628\u064E\u0644\u06E1 \u0647\u064F\u0648\u064E \u0634\u064E\u0631\u0651\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0633\u064E\u064A\u064F\u0637\u064E\u0648\u0651\u064E\u0642\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u0628\u064E\u062E\u0650\u0644\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06D7 \u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u064A\u0631\u064E\u0670\u062B\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 181, text: "\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0633\u064E\u0645\u0650\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064E\u0648\u06E1\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0642\u0650\u064A\u0631\u065E \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u063A\u06E1\u0646\u0650\u064A\u064E\u0627\u0653\u0621\u064F\u06D8 \u0633\u064E\u0646\u064E\u0643\u06E1\u062A\u064F\u0628\u064F \u0645\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0642\u064E\u062A\u06E1\u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E2\u0628\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u064E\u0642\u0651\u0656 \u0648\u064E\u0646\u064E\u0642\u064F\u0648\u0644\u064F \u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u0650\u064A\u0642\u0650" }, { id: 182, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u064A\u06E1\u0633\u064E \u0628\u0650\u0638\u064E\u0644\u0651\u064E\u0627\u0645\u0656 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0628\u0650\u064A\u062F\u0650" }, { id: 183, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0647\u0650\u062F\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0644\u0651\u064E\u0627 \u0646\u064F\u0624\u06E1\u0645\u0650\u0646\u064E \u0644\u0650\u0631\u064E\u0633\u064F\u0648\u0644\u064D \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u064E\u0627 \u0628\u0650\u0642\u064F\u0631\u06E1\u0628\u064E\u0627\u0646\u0656 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0647\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F\u06D7 \u0642\u064F\u0644\u06E1 \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u065E \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u064A \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0642\u064F\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0644\u0650\u0645\u064E \u0642\u064E\u062A\u064E\u0644\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 184, text: "\u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0643\u064E \u0641\u064E\u0642\u064E\u062F\u06E1 \u0643\u064F\u0630\u0651\u0650\u0628\u064E \u0631\u064F\u0633\u064F\u0644\u065E \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u062C\u064E\u0627\u0653\u0621\u064F\u0648 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0632\u0651\u064F\u0628\u064F\u0631\u0650 \u0648\u064E\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0650\u064A\u0631\u0650" }, { id: 185, text: "\u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0630\u064E\u0627\u0653\u0626\u0650\u0642\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062A\u064F\u0648\u064E\u0641\u0651\u064E\u0648\u06E1\u0646\u064E \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0643\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06D6 \u0641\u064E\u0645\u064E\u0646 \u0632\u064F\u062D\u06E1\u0632\u0650\u062D\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0648\u064E\u0623\u064F\u062F\u06E1\u062E\u0650\u0644\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0641\u064E\u0642\u064E\u062F\u06E1 \u0641\u064E\u0627\u0632\u064E\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u062A\u064E\u0670\u0639\u064F \u0671\u0644\u06E1\u063A\u064F\u0631\u064F\u0648\u0631\u0650" }, { id: 186, text: "\u06DE\u0644\u064E\u062A\u064F\u0628\u06E1\u0644\u064E\u0648\u064F\u0646\u0651\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u062A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0630\u0657\u0649 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0639\u064E\u0632\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u0650" }, { id: 187, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0644\u064E\u062A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0641\u064E\u0646\u064E\u0628\u064E\u0630\u064F\u0648\u0647\u064F \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E \u0638\u064F\u0647\u064F\u0648\u0631\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0671\u0634\u06E1\u062A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u062B\u064E\u0645\u064E\u0646\u0657\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627\u06D6 \u0641\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u0627 \u064A\u064E\u0634\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 188, text: "\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0641\u06E1\u0631\u064E\u062D\u064F\u0648\u0646\u064E \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u064A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064F\u062D\u06E1\u0645\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0641\u064E\u0627\u0632\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 189, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 190, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u062E\u064E\u0644\u06E1\u0642\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u062E\u06E1\u062A\u0650\u0644\u064E\u0670\u0641\u0650 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 191, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u0650\u064A\u064E\u0670\u0645\u0657\u0627 \u0648\u064E\u0642\u064F\u0639\u064F\u0648\u062F\u0657\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u062C\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u062E\u064E\u0644\u06E1\u0642\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u064E\u0670\u0637\u0650\u0644\u0657\u0627 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0643\u064E \u0641\u064E\u0642\u0650\u0646\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 192, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0645\u064E\u0646 \u062A\u064F\u062F\u06E1\u062E\u0650\u0644\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E \u0641\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u062E\u06E1\u0632\u064E\u064A\u06E1\u062A\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0644\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u0635\u064E\u0627\u0631\u0656" }, { id: 193, text: "\u0631\u0651\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0646\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0645\u064F\u0646\u064E\u0627\u062F\u0650\u064A\u0657\u0627 \u064A\u064F\u0646\u064E\u0627\u062F\u0650\u064A \u0644\u0650\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650 \u0623\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0640\u0654\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627\u06DA \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0641\u064E\u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0630\u064F\u0646\u064F\u0648\u0628\u064E\u0646\u064E\u0627 \u0648\u064E\u0643\u064E\u0641\u0651\u0650\u0631\u06E1 \u0639\u064E\u0646\u0651\u064E\u0627 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0646\u064E\u0627 \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0631\u064E\u0627\u0631\u0650" }, { id: 194, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u0621\u064E\u0627\u062A\u0650\u0646\u064E\u0627 \u0645\u064E\u0627 \u0648\u064E\u0639\u064E\u062F\u062A\u0651\u064E\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064F\u0633\u064F\u0644\u0650\u0643\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062E\u06E1\u0632\u0650\u0646\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0627 \u062A\u064F\u062E\u06E1\u0644\u0650\u0641\u064F \u0671\u0644\u06E1\u0645\u0650\u064A\u0639\u064E\u0627\u062F\u064E" }, { id: 195, text: "\u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0627\u0628\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u0650\u064A \u0644\u064E\u0627\u0653 \u0623\u064F\u0636\u0650\u064A\u0639\u064F \u0639\u064E\u0645\u064E\u0644\u064E \u0639\u064E\u0670\u0645\u0650\u0644\u0656 \u0645\u0651\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0630\u064E\u0643\u064E\u0631\u064D \u0623\u064E\u0648\u06E1 \u0623\u064F\u0646\u062B\u064E\u0649\u0670\u06D6 \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u0636\u0656\u06D6 \u0641\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062C\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064F\u0648\u0630\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u064A \u0648\u064E\u0642\u064E\u0670\u062A\u064E\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0642\u064F\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0623\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u064E\u0646\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0623\u064F\u062F\u06E1\u062E\u0650\u0644\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062B\u064E\u0648\u064E\u0627\u0628\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u062D\u064F\u0633\u06E1\u0646\u064F \u0671\u0644\u062B\u0651\u064E\u0648\u064E\u0627\u0628\u0650" }, { id: 196, text: "\u0644\u064E\u0627 \u064A\u064E\u063A\u064F\u0631\u0651\u064E\u0646\u0651\u064E\u0643\u064E \u062A\u064E\u0642\u064E\u0644\u0651\u064F\u0628\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u0650\u0644\u064E\u0670\u062F\u0650" }, { id: 197, text: "\u0645\u064E\u062A\u064E\u0670\u0639\u065E \u0642\u064E\u0644\u0650\u064A\u0644\u065E \u062B\u064F\u0645\u0651\u064E \u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u0650\u0647\u064E\u0627\u062F\u064F" }, { id: 198, text: "\u0644\u064E\u0670\u0643\u0650\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u065E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0646\u064F\u0632\u064F\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u06E1\u0623\u064E\u0628\u06E1\u0631\u064E\u0627\u0631\u0650" }, { id: 199, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062E\u064E\u0670\u0634\u0650\u0639\u0650\u064A\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064E\u0645\u064E\u0646\u0657\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0631\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 200, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0635\u064E\u0627\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0631\u064E\u0627\u0628\u0650\u0637\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }] }, { id: 4, name: "\u0627\u0644\u0646\u0633\u0627\u0621", transliteration: "An-Nisa", type: "medinan", total_verses: 176, verses: [{ id: 1, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0656 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0656 \u0648\u064E\u062E\u064E\u0644\u064E\u0642\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0632\u064E\u0648\u06E1\u062C\u064E\u0647\u064E\u0627 \u0648\u064E\u0628\u064E\u062B\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0631\u0650\u062C\u064E\u0627\u0644\u0657\u0627 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0646\u0650\u0633\u064E\u0627\u0653\u0621\u0657\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062A\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0631\u064E\u0642\u0650\u064A\u0628\u0657\u0627" }, { id: 2, text: "\u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u064E\u0628\u064E\u062F\u0651\u064E\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u064E \u0628\u0650\u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u0650\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u062D\u064F\u0648\u0628\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 3, text: "\u0648\u064E\u0625\u0650\u0646\u06E1 \u062E\u0650\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064F\u0642\u06E1\u0633\u0650\u0637\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u0641\u064E\u0671\u0646\u0643\u0650\u062D\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0637\u064E\u0627\u0628\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u062B\u06E1\u0646\u064E\u0649\u0670 \u0648\u064E\u062B\u064F\u0644\u064E\u0670\u062B\u064E \u0648\u064E\u0631\u064F\u0628\u064E\u0670\u0639\u064E\u06D6 \u0641\u064E\u0625\u0650\u0646\u06E1 \u062E\u0650\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670\u0653 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u064F\u0648\u0644\u064F\u0648\u0627\u0652" }, { id: 4, text: "\u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0635\u064E\u062F\u064F\u0642\u064E\u0670\u062A\u0650\u0647\u0650\u0646\u0651\u064E \u0646\u0650\u062D\u06E1\u0644\u064E\u0629\u0657\u06DA \u0641\u064E\u0625\u0650\u0646 \u0637\u0650\u0628\u06E1\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0646\u064E\u0641\u06E1\u0633\u0657\u0627 \u0641\u064E\u0643\u064F\u0644\u064F\u0648\u0647\u064F \u0647\u064E\u0646\u0650\u064A\u0653\u0640\u0654\u0657\u0627 \u0645\u0651\u064E\u0631\u0650\u064A\u0653\u0640\u0654\u0657\u0627" }, { id: 5, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0624\u06E1\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064F\u0641\u064E\u0647\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0642\u0650\u064A\u064E\u0670\u0645\u0657\u0627 \u0648\u064E\u0671\u0631\u06E1\u0632\u064F\u0642\u064F\u0648\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0671\u0643\u06E1\u0633\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0645\u0651\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0657\u0627" }, { id: 6, text: "\u0648\u064E\u0671\u0628\u06E1\u062A\u064E\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u0650\u0643\u064E\u0627\u062D\u064E \u0641\u064E\u0625\u0650\u0646\u06E1 \u0621\u064E\u0627\u0646\u064E\u0633\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0634\u06E1\u062F\u0657\u0627 \u0641\u064E\u0671\u062F\u06E1\u0641\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0647\u064E\u0627\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0627\u0641\u0657\u0627 \u0648\u064E\u0628\u0650\u062F\u064E\u0627\u0631\u064B\u0627 \u0623\u064E\u0646 \u064A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u063A\u064E\u0646\u0650\u064A\u0651\u0657\u0627 \u0641\u064E\u0644\u06E1\u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u0641\u0650\u0641\u06E1\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0641\u064E\u0642\u0650\u064A\u0631\u0657\u0627 \u0641\u064E\u0644\u06E1\u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u06E1 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650\u06DA \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062F\u064E\u0641\u064E\u0639\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0634\u06E1\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0633\u0650\u064A\u0628\u0657\u0627" }, { id: 7, text: "\u0644\u0651\u0650\u0644\u0631\u0651\u0650\u062C\u064E\u0627\u0644\u0650 \u0646\u064E\u0635\u0650\u064A\u0628\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E \u0671\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u0627\u0646\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u0650\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0646\u064E\u0635\u0650\u064A\u0628\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E \u0671\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u0627\u0646\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0646\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u0642\u064E\u0644\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0623\u064E\u0648\u06E1 \u0643\u064E\u062B\u064F\u0631\u064E\u06DA \u0646\u064E\u0635\u0650\u064A\u0628\u0657\u0627 \u0645\u0651\u064E\u0641\u06E1\u0631\u064F\u0648\u0636\u0657\u0627" }, { id: 8, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062D\u064E\u0636\u064E\u0631\u064E \u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0645\u064E\u0629\u064E \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u064F \u0641\u064E\u0671\u0631\u06E1\u0632\u064F\u0642\u064F\u0648\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0645\u0651\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0657\u0627" }, { id: 9, text: "\u0648\u064E\u0644\u06E1\u064A\u064E\u062E\u06E1\u0634\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0648\u06E1 \u062A\u064E\u0631\u064E\u0643\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u0650\u0647\u0650\u0645\u06E1 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u0657 \u0636\u0650\u0639\u064E\u0670\u0641\u064B\u0627 \u062E\u064E\u0627\u0641\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0644\u06E1\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0633\u064E\u062F\u0650\u064A\u062F\u064B\u0627" }, { id: 10, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E \u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u0638\u064F\u0644\u06E1\u0645\u064B\u0627 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0628\u064F\u0637\u064F\u0648\u0646\u0650\u0647\u0650\u0645\u06E1 \u0646\u064E\u0627\u0631\u0657\u0627\u06D6 \u0648\u064E\u0633\u064E\u064A\u064E\u0635\u06E1\u0644\u064E\u0648\u06E1\u0646\u064E \u0633\u064E\u0639\u0650\u064A\u0631\u0657\u0627" }, { id: 11, text: "\u064A\u064F\u0648\u0635\u0650\u064A\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A\u0653 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0644\u0650\u0644\u0630\u0651\u064E\u0643\u064E\u0631\u0650 \u0645\u0650\u062B\u06E1\u0644\u064F \u062D\u064E\u0638\u0651\u0650 \u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u064A\u064E\u064A\u06E1\u0646\u0650\u06DA \u0641\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E \u0646\u0650\u0633\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0648\u06E1\u0642\u064E \u0671\u062B\u06E1\u0646\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u0644\u064E\u0647\u064F\u0646\u0651\u064E \u062B\u064F\u0644\u064F\u062B\u064E\u0627 \u0645\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0641\u064E\u0644\u064E\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u0650\u0635\u06E1\u0641\u064F\u06DA \u0648\u064E\u0644\u0650\u0623\u064E\u0628\u064E\u0648\u064E\u064A\u06E1\u0647\u0650 \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0648\u064E\u0670\u062D\u0650\u062F\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u0633\u0651\u064F\u062F\u064F\u0633\u064F \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u062F\u065E\u06DA \u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u062F\u065E \u0648\u064E\u0648\u064E\u0631\u0650\u062B\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0628\u064E\u0648\u064E\u0627\u0647\u064F \u0641\u064E\u0644\u0650\u0623\u064F\u0645\u0651\u0650\u0647\u0650 \u0671\u0644\u062B\u0651\u064F\u0644\u064F\u062B\u064F\u06DA \u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u062E\u06E1\u0648\u064E\u0629\u065E \u0641\u064E\u0644\u0650\u0623\u064F\u0645\u0651\u0650\u0647\u0650 \u0671\u0644\u0633\u0651\u064F\u062F\u064F\u0633\u064F\u06DA \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0648\u064E\u0635\u0650\u064A\u0651\u064E\u0629\u0656 \u064A\u064F\u0648\u0635\u0650\u064A \u0628\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u062F\u064E\u064A\u06E1\u0646\u064D\u06D7 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u062F\u06E1\u0631\u064F\u0648\u0646\u064E \u0623\u064E\u064A\u0651\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0646\u064E\u0641\u06E1\u0639\u0657\u0627\u06DA \u0641\u064E\u0631\u0650\u064A\u0636\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 12, text: "\u06DE\u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0646\u0650\u0635\u06E1\u0641\u064F \u0645\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u062F\u065E\u06DA \u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u062F\u065E \u0641\u064E\u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064F\u0628\u064F\u0639\u064F \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u06E1\u0646\u064E\u06DA \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0648\u064E\u0635\u0650\u064A\u0651\u064E\u0629\u0656 \u064A\u064F\u0648\u0635\u0650\u064A\u0646\u064E \u0628\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u062F\u064E\u064A\u06E1\u0646\u0656\u06DA \u0648\u064E\u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0671\u0644\u0631\u0651\u064F\u0628\u064F\u0639\u064F \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u062F\u065E\u06DA \u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u062F\u065E \u0641\u064E\u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0671\u0644\u062B\u0651\u064F\u0645\u064F\u0646\u064F \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u06E1\u062A\u064F\u0645\u06DA \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0648\u064E\u0635\u0650\u064A\u0651\u064E\u0629\u0656 \u062A\u064F\u0648\u0635\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u062F\u064E\u064A\u06E1\u0646\u0656\u06D7 \u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0631\u064E\u062C\u064F\u0644\u065E \u064A\u064F\u0648\u0631\u064E\u062B\u064F \u0643\u064E\u0644\u064E\u0670\u0644\u064E\u0629\u064B \u0623\u064E\u0648\u0650 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062E\u064C \u0623\u064E\u0648\u06E1 \u0623\u064F\u062E\u06E1\u062A\u065E \u0641\u064E\u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0648\u064E\u0670\u062D\u0650\u062F\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u0633\u0651\u064F\u062F\u064F\u0633\u064F\u06DA \u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0645\u0650\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0647\u064F\u0645\u06E1 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064F \u0641\u0650\u064A \u0671\u0644\u062B\u0651\u064F\u0644\u064F\u062B\u0650\u06DA \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0648\u064E\u0635\u0650\u064A\u0651\u064E\u0629\u0656 \u064A\u064F\u0648\u0635\u064E\u0649\u0670 \u0628\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u062F\u064E\u064A\u06E1\u0646\u064D \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u0636\u064E\u0627\u0653\u0631\u0651\u0656\u06DA \u0648\u064E\u0635\u0650\u064A\u0651\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 13, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u062D\u064F\u062F\u064F\u0648\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0637\u0650\u0639\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u06E1\u0647\u064F \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 14, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0635\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u064A\u064E\u062A\u064E\u0639\u064E\u062F\u0651\u064E \u062D\u064F\u062F\u064F\u0648\u062F\u064E\u0647\u064F\u06E5 \u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u06E1\u0647\u064F \u0646\u064E\u0627\u0631\u064B\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u0657\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u065E" }, { id: 15, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0640\u0670\u062A\u0650\u064A \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u064E \u0645\u0650\u0646 \u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0634\u06E1\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0625\u0650\u0646 \u0634\u064E\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u064E\u0645\u06E1\u0633\u0650\u0643\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064F\u064A\u064F\u0648\u062A\u0650 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670\u0647\u064F\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u0623\u064E\u0648\u06E1 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 16, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u064E\u0627\u0646\u0650 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0670\u0646\u0650\u0647\u064E\u0627 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0641\u064E\u0640\u0654\u064E\u0627\u0630\u064F\u0648\u0647\u064F\u0645\u064E\u0627\u06D6 \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0627\u0628\u064E\u0627 \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064E\u0627 \u0641\u064E\u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064E\u0627\u0653\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u062A\u064E\u0648\u0651\u064E\u0627\u0628\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064B\u0627" }, { id: 17, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0628\u064E\u0629\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u064E \u0628\u0650\u062C\u064E\u0647\u064E\u0670\u0644\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u062A\u064F\u0648\u0628\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0631\u0650\u064A\u0628\u0656 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064E\u062A\u064F\u0648\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 18, text: "\u0648\u064E\u0644\u064E\u064A\u06E1\u0633\u064E\u062A\u0650 \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0628\u064E\u0629\u064F \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062D\u064E\u0636\u064E\u0631\u064E \u0623\u064E\u062D\u064E\u062F\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u062A\u064F\u0628\u06E1\u062A\u064F \u0671\u0644\u06E1\u0640\u0654\u064E\u0670\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0645\u064F\u0648\u062A\u064F\u0648\u0646\u064E \u0648\u064E\u0647\u064F\u0645\u06E1 \u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064C\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 19, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u062D\u0650\u0644\u0651\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0631\u0650\u062B\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0643\u064E\u0631\u06E1\u0647\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0636\u064F\u0644\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0644\u0650\u062A\u064E\u0630\u06E1\u0647\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0650 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E \u0628\u0650\u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u0656 \u0645\u0651\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656\u06DA \u0648\u064E\u0639\u064E\u0627\u0634\u0650\u0631\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650\u06DA \u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0631\u0650\u0647\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064E\u0643\u06E1\u0631\u064E\u0647\u064F\u0648\u0627\u0652 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A\u0647\u0650 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627" }, { id: 20, text: "\u0648\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u062F\u062A\u0651\u064F\u0645\u064F \u0671\u0633\u06E1\u062A\u0650\u0628\u06E1\u062F\u064E\u0627\u0644\u064E \u0632\u064E\u0648\u06E1\u062C\u0656 \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u064E \u0632\u064E\u0648\u06E1\u062C\u0656 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u062D\u06E1\u062F\u064E\u0649\u0670\u0647\u064F\u0646\u0651\u064E \u0642\u0650\u0646\u0637\u064E\u0627\u0631\u0657\u0627 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627\u06DA \u0623\u064E\u062A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0628\u064F\u0647\u06E1\u062A\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0625\u0650\u062B\u06E1\u0645\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 21, text: "\u0648\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0641\u06E1\u0636\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u0648\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u064A\u062B\u064E\u0670\u0642\u064B\u0627 \u063A\u064E\u0644\u0650\u064A\u0638\u0657\u0627" }, { id: 22, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u0643\u0650\u062D\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0646\u064E\u0643\u064E\u062D\u064E \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0642\u064E\u062F\u06E1 \u0633\u064E\u0644\u064E\u0641\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u0657 \u0648\u064E\u0645\u064E\u0642\u06E1\u062A\u0657\u0627 \u0648\u064E\u0633\u064E\u0627\u0653\u0621\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u064B\u0627" }, { id: 23, text: "\u062D\u064F\u0631\u0651\u0650\u0645\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u0646\u064E\u0627\u062A\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u062E\u064E\u0648\u064E\u0670\u062A\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0639\u064E\u0645\u0651\u064E\u0640\u0670\u062A\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u062E\u064E\u0670\u0644\u064E\u0670\u062A\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u0646\u064E\u0627\u062A\u064F \u0671\u0644\u06E1\u0623\u064E\u062E\u0650 \u0648\u064E\u0628\u064E\u0646\u064E\u0627\u062A\u064F \u0671\u0644\u06E1\u0623\u064F\u062E\u06E1\u062A\u0650 \u0648\u064E\u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0640\u0670\u062A\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u0636\u064E\u0639\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u062E\u064E\u0648\u064E\u0670\u062A\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u0636\u064E\u0670\u0639\u064E\u0629\u0650 \u0648\u064E\u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u064F \u0646\u0650\u0633\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0628\u064E\u0640\u0670\u0653\u0626\u0650\u0628\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0640\u0670\u062A\u0650\u064A \u0641\u0650\u064A \u062D\u064F\u062C\u064F\u0648\u0631\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0640\u0670\u062A\u0650\u064A \u062F\u064E\u062E\u064E\u0644\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u0646\u0651\u064E \u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u062F\u064E\u062E\u064E\u0644\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u0646\u0651\u064E \u0641\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u062D\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0644\u064F \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0635\u06E1\u0644\u064E\u0670\u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646 \u062A\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0623\u064F\u062E\u06E1\u062A\u064E\u064A\u06E1\u0646\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0642\u064E\u062F\u06E1 \u0633\u064E\u0644\u064E\u0641\u064E\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 24, text: "\u06DE\u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0635\u064E\u0646\u064E\u0670\u062A\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0623\u064F\u062D\u0650\u0644\u0651\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0643\u064F\u0645 \u0645\u0651\u064F\u062D\u06E1\u0635\u0650\u0646\u0650\u064A\u0646\u064E \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u0633\u064E\u0670\u0641\u0650\u062D\u0650\u064A\u0646\u064E\u06DA \u0641\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0645\u06E1\u062A\u064E\u0639\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0640\u0654\u064E\u0627\u062A\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0631\u0650\u064A\u0636\u064E\u0629\u0657\u06DA \u0648\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0645\u064E\u0627 \u062A\u064E\u0631\u064E\u0670\u0636\u064E\u064A\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0671\u0644\u06E1\u0641\u064E\u0631\u0650\u064A\u0636\u064E\u0629\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 25, text: "\u0648\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u0639\u06E1 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0637\u064E\u0648\u06E1\u0644\u064B\u0627 \u0623\u064E\u0646 \u064A\u064E\u0646\u0643\u0650\u062D\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0635\u064E\u0646\u064E\u0670\u062A\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0645\u0650\u0646 \u0645\u0651\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u062A\u064E\u064A\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06DA \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u0641\u064E\u0671\u0646\u0643\u0650\u062D\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064F\u0646\u0651\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0645\u064F\u062D\u06E1\u0635\u064E\u0646\u064E\u0670\u062A\u064D \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u0633\u064E\u0670\u0641\u0650\u062D\u064E\u0670\u062A\u0656 \u0648\u064E\u0644\u064E\u0627 \u0645\u064F\u062A\u0651\u064E\u062E\u0650\u0630\u064E\u0670\u062A\u0650 \u0623\u064E\u062E\u06E1\u062F\u064E\u0627\u0646\u0656\u06DA \u0641\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064F\u062D\u06E1\u0635\u0650\u0646\u0651\u064E \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u062A\u064E\u064A\u06E1\u0646\u064E \u0628\u0650\u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u0656 \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u0646\u0650\u0635\u06E1\u0641\u064F \u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0635\u064E\u0646\u064E\u0670\u062A\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u0645\u064E\u0646\u06E1 \u062E\u064E\u0634\u0650\u064A\u064E \u0671\u0644\u06E1\u0639\u064E\u0646\u064E\u062A\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0623\u064E\u0646 \u062A\u064E\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 26, text: "\u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u064E\u0643\u064F\u0645\u06E1 \u0633\u064F\u0646\u064E\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u062A\u064F\u0648\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 27, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u064A\u064E\u062A\u064F\u0648\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0648\u064E\u0670\u062A\u0650 \u0623\u064E\u0646 \u062A\u064E\u0645\u0650\u064A\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u064A\u06E1\u0644\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 28, text: "\u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064F\u062E\u064E\u0641\u0651\u0650\u0641\u064E \u0639\u064E\u0646\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u062E\u064F\u0644\u0650\u0642\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0636\u064E\u0639\u0650\u064A\u0641\u0657\u0627" }, { id: 29, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0643\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u062A\u0650\u062C\u064E\u0670\u0631\u064E\u0629\u064B \u0639\u064E\u0646 \u062A\u064E\u0631\u064E\u0627\u0636\u0656 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0631\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 30, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u06E1 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064F\u062F\u06E1\u0648\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0638\u064F\u0644\u06E1\u0645\u0657\u0627 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u0646\u064F\u0635\u06E1\u0644\u0650\u064A\u0647\u0650 \u0646\u064E\u0627\u0631\u0657\u0627\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0633\u0650\u064A\u0631\u064B\u0627" }, { id: 31, text: "\u0625\u0650\u0646 \u062A\u064E\u062C\u06E1\u062A\u064E\u0646\u0650\u0628\u064F\u0648\u0627\u0652 \u0643\u064E\u0628\u064E\u0627\u0653\u0626\u0650\u0631\u064E \u0645\u064E\u0627 \u062A\u064F\u0646\u06E1\u0647\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646\u06E1\u0647\u064F \u0646\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u06E1 \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0646\u064F\u062F\u06E1\u062E\u0650\u0644\u06E1\u0643\u064F\u0645 \u0645\u0651\u064F\u062F\u06E1\u062E\u064E\u0644\u0657\u0627 \u0643\u064E\u0631\u0650\u064A\u0645\u0657\u0627" }, { id: 32, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u064E\u0645\u064E\u0646\u0651\u064E\u0648\u06E1\u0627\u0652 \u0645\u064E\u0627 \u0641\u064E\u0636\u0651\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u0650\u06E6 \u0628\u064E\u0639\u06E1\u0636\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u0644\u0651\u0650\u0644\u0631\u0651\u0650\u062C\u064E\u0627\u0644\u0650 \u0646\u064E\u0635\u0650\u064A\u0628\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0671\u0643\u06E1\u062A\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0644\u0650\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0646\u064E\u0635\u0650\u064A\u0628\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0671\u0643\u06E1\u062A\u064E\u0633\u064E\u0628\u06E1\u0646\u064E\u06DA \u0648\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 33, text: "\u0648\u064E\u0644\u0650\u0643\u064F\u0644\u0651\u0656 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0648\u064E\u0670\u0644\u0650\u064A\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E \u0671\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u0627\u0646\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u064E\u0642\u064E\u062F\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0640\u0654\u064E\u0627\u062A\u064F\u0648\u0647\u064F\u0645\u06E1 \u0646\u064E\u0635\u0650\u064A\u0628\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u064B\u0627" }, { id: 34, text: "\u0671\u0644\u0631\u0651\u0650\u062C\u064E\u0627\u0644\u064F \u0642\u064E\u0648\u0651\u064E\u0640\u0670\u0645\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0628\u0650\u0645\u064E\u0627 \u0641\u064E\u0636\u0651\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u0648\u064E\u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0641\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u064F \u0642\u064E\u0670\u0646\u0650\u062A\u064E\u0670\u062A\u064C \u062D\u064E\u0670\u0641\u0650\u0638\u064E\u0670\u062A\u065E \u0644\u0651\u0650\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0628\u0650\u0645\u064E\u0627 \u062D\u064E\u0641\u0650\u0638\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0640\u0670\u062A\u0650\u064A \u062A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0646\u064F\u0634\u064F\u0648\u0632\u064E\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0639\u0650\u0638\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0671\u0647\u06E1\u062C\u064F\u0631\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u0636\u064E\u0627\u062C\u0650\u0639\u0650 \u0648\u064E\u0671\u0636\u06E1\u0631\u0650\u0628\u064F\u0648\u0647\u064F\u0646\u0651\u064E\u06D6 \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u063A\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u064B\u0627\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 35, text: "\u0648\u064E\u0625\u0650\u0646\u06E1 \u062E\u0650\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0634\u0650\u0642\u064E\u0627\u0642\u064E \u0628\u064E\u064A\u06E1\u0646\u0650\u0647\u0650\u0645\u064E\u0627 \u0641\u064E\u0671\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0627\u0652 \u062D\u064E\u0643\u064E\u0645\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u062D\u064E\u0643\u064E\u0645\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u064E\u0627\u0653 \u0625\u0650\u0646 \u064A\u064F\u0631\u0650\u064A\u062F\u064E\u0627\u0653 \u0625\u0650\u0635\u06E1\u0644\u064E\u0670\u062D\u0657\u0627 \u064A\u064F\u0648\u064E\u0641\u0651\u0650\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u0653\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062E\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 36, text: "\u06DE\u0648\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06D6 \u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0646\u0650 \u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0628\u0650\u0630\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u0650 \u0648\u064E\u0671\u0644\u06E1\u062C\u064E\u0627\u0631\u0650 \u0630\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u062C\u064E\u0627\u0631\u0650 \u0671\u0644\u06E1\u062C\u064F\u0646\u064F\u0628\u0650 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0627\u062D\u0650\u0628\u0650 \u0628\u0650\u0671\u0644\u06E1\u062C\u064E\u0646\u06E2\u0628\u0650 \u0648\u064E\u0671\u0628\u06E1\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650 \u0648\u064E\u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u064F\u062E\u06E1\u062A\u064E\u0627\u0644\u0657\u0627 \u0641\u064E\u062E\u064F\u0648\u0631\u064B\u0627" }, { id: 37, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0628\u06E1\u062E\u064E\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0628\u0650\u0671\u0644\u06E1\u0628\u064F\u062E\u06E1\u0644\u0650 \u0648\u064E\u064A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u0657\u0627" }, { id: 38, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0631\u0650\u0626\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u064F\u0646\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0642\u064E\u0631\u0650\u064A\u0646\u0657\u0627 \u0641\u064E\u0633\u064E\u0627\u0653\u0621\u064E \u0642\u064E\u0631\u0650\u064A\u0646\u0657\u0627" }, { id: 39, text: "\u0648\u064E\u0645\u064E\u0627\u0630\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0644\u064E\u0648\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u0650\u0645\u06E1 \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627" }, { id: 40, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F \u0645\u0650\u062B\u06E1\u0642\u064E\u0627\u0644\u064E \u0630\u064E\u0631\u0651\u064E\u0629\u0656\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0643\u064F \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0657 \u064A\u064F\u0636\u064E\u0670\u0639\u0650\u0641\u06E1\u0647\u064E\u0627 \u0648\u064E\u064A\u064F\u0624\u06E1\u062A\u0650 \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u06E1\u0647\u064F \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 41, text: "\u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0625\u0650\u0630\u064E\u0627 \u062C\u0650\u0626\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u0650\u06ED \u0628\u0650\u0634\u064E\u0647\u0650\u064A\u062F\u0656 \u0648\u064E\u062C\u0650\u0626\u06E1\u0646\u064E\u0627 \u0628\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0634\u064E\u0647\u0650\u064A\u062F\u0657\u0627" }, { id: 42, text: "\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064E\u0648\u064E\u062F\u0651\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0635\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0644\u064E\u0648\u06E1 \u062A\u064F\u0633\u064E\u0648\u0651\u064E\u0649\u0670 \u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062D\u064E\u062F\u0650\u064A\u062B\u0657\u0627" }, { id: 43, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0633\u064F\u0643\u064E\u0670\u0631\u064E\u0649\u0670 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064F\u0628\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0627\u0628\u0650\u0631\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u064D \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u063A\u06E1\u062A\u064E\u0633\u0650\u0644\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064E\u0631\u06E1\u0636\u064E\u0649\u0670\u0653 \u0623\u064E\u0648\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064E\u0641\u064E\u0631\u064D \u0623\u064E\u0648\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u062D\u064E\u062F\u065E \u0645\u0651\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0627\u0653\u0626\u0650\u0637\u0650 \u0623\u064E\u0648\u06E1 \u0644\u064E\u0670\u0645\u064E\u0633\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u062A\u064E\u064A\u064E\u0645\u0651\u064E\u0645\u064F\u0648\u0627\u0652 \u0635\u064E\u0639\u0650\u064A\u062F\u0657\u0627 \u0637\u064E\u064A\u0651\u0650\u0628\u0657\u0627 \u0641\u064E\u0671\u0645\u06E1\u0633\u064E\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0648\u064F\u062C\u064F\u0648\u0647\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0643\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0641\u064F\u0648\u0651\u064B\u0627 \u063A\u064E\u0641\u064F\u0648\u0631\u064B\u0627" }, { id: 44, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0646\u064E\u0635\u0650\u064A\u0628\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u064A\u064E\u0634\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u0636\u0651\u064E\u0644\u064E\u0670\u0644\u064E\u0629\u064E \u0648\u064E\u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u062A\u064E\u0636\u0650\u0644\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u064E" }, { id: 45, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0623\u064E\u0639\u06E1\u062F\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0646\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 46, text: "\u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u064A\u064F\u062D\u064E\u0631\u0651\u0650\u0641\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0644\u0650\u0645\u064E \u0639\u064E\u0646 \u0645\u0651\u064E\u0648\u064E\u0627\u0636\u0650\u0639\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0648\u064E\u0639\u064E\u0635\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0671\u0633\u06E1\u0645\u064E\u0639\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u0633\u06E1\u0645\u064E\u0639\u0656 \u0648\u064E\u0631\u064E\u0670\u0639\u0650\u0646\u064E\u0627 \u0644\u064E\u064A\u0651\u064E\u06E2\u0627 \u0628\u0650\u0623\u064E\u0644\u06E1\u0633\u0650\u0646\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0637\u064E\u0639\u06E1\u0646\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627 \u0648\u064E\u0671\u0633\u06E1\u0645\u064E\u0639\u06E1 \u0648\u064E\u0671\u0646\u0638\u064F\u0631\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064E\u0627\u0646\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0642\u06E1\u0648\u064E\u0645\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u064E\u0639\u064E\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0641\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 47, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0645\u064E\u0639\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u0646\u0651\u064E\u0637\u06E1\u0645\u0650\u0633\u064E \u0648\u064F\u062C\u064F\u0648\u0647\u0657\u0627 \u0641\u064E\u0646\u064E\u0631\u064F\u062F\u0651\u064E\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062F\u06E1\u0628\u064E\u0627\u0631\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0646\u064E\u0644\u06E1\u0639\u064E\u0646\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627 \u0644\u064E\u0639\u064E\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u06E1\u062A\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0645\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0641\u06E1\u0639\u064F\u0648\u0644\u064B\u0627" }, { id: 48, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0623\u064E\u0646 \u064A\u064F\u0634\u06E1\u0631\u064E\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0645\u064E\u0627 \u062F\u064F\u0648\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u06E1 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0642\u064E\u062F\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u062B\u06E1\u0645\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u064B\u0627" }, { id: 49, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0632\u064E\u0643\u0651\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06DA \u0628\u064E\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0632\u064E\u0643\u0651\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0641\u064E\u062A\u0650\u064A\u0644\u064B\u0627" }, { id: 50, text: "\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E\u06D6 \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u062B\u06E1\u0645\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064B\u0627" }, { id: 51, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0646\u064E\u0635\u0650\u064A\u0628\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u062C\u0650\u0628\u06E1\u062A\u0650 \u0648\u064E\u0671\u0644\u0637\u0651\u064E\u0640\u0670\u063A\u064F\u0648\u062A\u0650 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u0647\u06E1\u062F\u064E\u0649\u0670 \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0633\u064E\u0628\u0650\u064A\u0644\u064B\u0627" }, { id: 52, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0639\u064E\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0644\u06E1\u0639\u064E\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0644\u064E\u0647\u064F\u06E5 \u0646\u064E\u0635\u0650\u064A\u0631\u064B\u0627" }, { id: 53, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0635\u0650\u064A\u0628\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u0650 \u0641\u064E\u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0646\u064E\u0642\u0650\u064A\u0631\u064B\u0627" }, { id: 54, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0633\u064F\u062F\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0644\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u064F\u0644\u06E1\u0643\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 55, text: "\u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u0635\u064E\u062F\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0633\u064E\u0639\u0650\u064A\u0631\u064B\u0627" }, { id: 56, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0633\u064E\u0648\u06E1\u0641\u064E \u0646\u064F\u0635\u06E1\u0644\u0650\u064A\u0647\u0650\u0645\u06E1 \u0646\u064E\u0627\u0631\u0657\u0627 \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627 \u0646\u064E\u0636\u0650\u062C\u064E\u062A\u06E1 \u062C\u064F\u0644\u064F\u0648\u062F\u064F\u0647\u064F\u0645 \u0628\u064E\u062F\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u062C\u064F\u0644\u064F\u0648\u062F\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E\u0647\u064E\u0627 \u0644\u0650\u064A\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 57, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0633\u064E\u0646\u064F\u062F\u06E1\u062E\u0650\u0644\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06D6 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u065E \u0645\u0651\u064F\u0637\u064E\u0647\u0651\u064E\u0631\u064E\u0629\u065E\u06D6 \u0648\u064E\u0646\u064F\u062F\u06E1\u062E\u0650\u0644\u064F\u0647\u064F\u0645\u06E1 \u0638\u0650\u0644\u0651\u0657\u0627 \u0638\u064E\u0644\u0650\u064A\u0644\u064B\u0627" }, { id: 58, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064F\u0624\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0645\u064E\u0670\u0646\u064E\u0670\u062A\u0650 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u064E\u0627 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062D\u064E\u0643\u064E\u0645\u06E1\u062A\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0623\u064E\u0646 \u062A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u062F\u06E1\u0644\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0646\u0650\u0639\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u0650\u0638\u064F\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u0653\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064E\u06E2\u0627 \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 59, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0646\u064E\u0670\u0632\u064E\u0639\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0631\u064F\u062F\u0651\u064F\u0648\u0647\u064F \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0648\u064E\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u064B\u0627" }, { id: 60, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0632\u06E1\u0639\u064F\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u062A\u064E\u062D\u064E\u0627\u0643\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0637\u0651\u064E\u0640\u0670\u063A\u064F\u0648\u062A\u0650 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0623\u064F\u0645\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0623\u064E\u0646 \u064A\u064F\u0636\u0650\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0636\u064E\u0644\u064E\u0670\u0644\u064E\u06E2\u0627 \u0628\u064E\u0639\u0650\u064A\u062F\u0657\u0627" }, { id: 61, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062A\u064E\u0639\u064E\u0627\u0644\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u0643\u064E \u0635\u064F\u062F\u064F\u0648\u062F\u0657\u0627" }, { id: 62, text: "\u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0670\u0628\u064E\u062A\u06E1\u0647\u064F\u0645 \u0645\u0651\u064F\u0635\u0650\u064A\u0628\u064E\u0629\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0643\u064E \u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u062A\u064E\u0648\u06E1\u0641\u0650\u064A\u0642\u064B\u0627" }, { id: 63, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0639\u0650\u0638\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064F\u0644 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0644\u064E\u06E2\u0627 \u0628\u064E\u0644\u0650\u064A\u063A\u0657\u0627" }, { id: 64, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u064A\u064F\u0637\u064E\u0627\u0639\u064E \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0630 \u0638\u0651\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0643\u064E \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u064E\u0631\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0644\u064E\u0648\u064E\u062C\u064E\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062A\u064E\u0648\u0651\u064E\u0627\u0628\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 65, text: "\u0641\u064E\u0644\u064E\u0627 \u0648\u064E\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u062D\u064E\u0643\u0651\u0650\u0645\u064F\u0648\u0643\u064E \u0641\u0650\u064A\u0645\u064E\u0627 \u0634\u064E\u062C\u064E\u0631\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u0631\u064E\u062C\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0642\u064E\u0636\u064E\u064A\u06E1\u062A\u064E \u0648\u064E\u064A\u064F\u0633\u064E\u0644\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u062A\u064E\u0633\u06E1\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 66, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0627 \u0643\u064E\u062A\u064E\u0628\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646\u0650 \u0671\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u0650 \u0671\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u064F\u0648\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u064A\u064F\u0648\u0639\u064E\u0638\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0644\u064E\u0643\u064E\u0627\u0646\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0634\u064E\u062F\u0651\u064E \u062A\u064E\u062B\u06E1\u0628\u0650\u064A\u062A\u0657\u0627" }, { id: 67, text: "\u0648\u064E\u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0623\u0653\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 68, text: "\u0648\u064E\u0644\u064E\u0647\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0635\u0650\u0631\u064E\u0670\u0637\u0657\u0627 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0657\u0627" }, { id: 69, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0637\u0650\u0639\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0648\u064E\u0671\u0644\u0635\u0651\u0650\u062F\u0651\u0650\u064A\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u0634\u0651\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E\u06DA \u0648\u064E\u062D\u064E\u0633\u064F\u0646\u064E \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0631\u064E\u0641\u0650\u064A\u0642\u0657\u0627" }, { id: 70, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 71, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u062E\u064F\u0630\u064F\u0648\u0627\u0652 \u062D\u0650\u0630\u06E1\u0631\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0646\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u062B\u064F\u0628\u064E\u0627\u062A\u064D \u0623\u064E\u0648\u0650 \u0671\u0646\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627" }, { id: 72, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0644\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u064A\u064F\u0628\u064E\u0637\u0651\u0650\u0626\u064E\u0646\u0651\u064E \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0635\u064E\u0670\u0628\u064E\u062A\u06E1\u0643\u064F\u0645 \u0645\u0651\u064F\u0635\u0650\u064A\u0628\u064E\u0629\u065E \u0642\u064E\u0627\u0644\u064E \u0642\u064E\u062F\u06E1 \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0625\u0650\u0630\u06E1 \u0644\u064E\u0645\u06E1 \u0623\u064E\u0643\u064F\u0646 \u0645\u0651\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0634\u064E\u0647\u0650\u064A\u062F\u0657\u0627" }, { id: 73, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0635\u064E\u0670\u0628\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0636\u06E1\u0644\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064E\u0646\u0651\u064E \u0643\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0645\u064E\u0648\u064E\u062F\u0651\u064E\u0629\u065E \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0643\u064F\u0646\u062A\u064F \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0641\u064F\u0648\u0632\u064E \u0641\u064E\u0648\u06E1\u0632\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 74, text: "\u06DE\u0641\u064E\u0644\u06E1\u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0634\u06E1\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u064A\u064F\u0642\u06E1\u062A\u064E\u0644\u06E1 \u0623\u064E\u0648\u06E1 \u064A\u064E\u063A\u06E1\u0644\u0650\u0628\u06E1 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u0646\u064F\u0624\u06E1\u062A\u0650\u064A\u0647\u0650 \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 75, text: "\u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0636\u06E1\u0639\u064E\u0641\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u062C\u064E\u0627\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0648\u0650\u0644\u06E1\u062F\u064E\u0670\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0631\u0650\u062C\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0650 \u0671\u0644\u0638\u0651\u064E\u0627\u0644\u0650\u0645\u0650 \u0623\u064E\u0647\u06E1\u0644\u064F\u0647\u064E\u0627 \u0648\u064E\u0671\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0646\u064E\u0627 \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0643\u064E \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0671\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0646\u064E\u0627 \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0643\u064E \u0646\u064E\u0635\u0650\u064A\u0631\u064B\u0627" }, { id: 76, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0637\u0651\u064E\u0640\u0670\u063A\u064F\u0648\u062A\u0650 \u0641\u064E\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E \u0643\u064E\u064A\u06E1\u062F\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0643\u064E\u0627\u0646\u064E \u0636\u064E\u0639\u0650\u064A\u0641\u064B\u0627" }, { id: 77, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0643\u064F\u0641\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0643\u064F\u062A\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0642\u0650\u062A\u064E\u0627\u0644\u064F \u0625\u0650\u0630\u064E\u0627 \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0643\u064E\u062E\u064E\u0634\u06E1\u064A\u064E\u0629\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0634\u064E\u062F\u0651\u064E \u062E\u064E\u0634\u06E1\u064A\u064E\u0629\u0657\u06DA \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u0650\u0645\u064E \u0643\u064E\u062A\u064E\u0628\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0642\u0650\u062A\u064E\u0627\u0644\u064E \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u062E\u0651\u064E\u0631\u06E1\u062A\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0642\u064E\u0631\u0650\u064A\u0628\u0656\u06D7 \u0642\u064F\u0644\u06E1 \u0645\u064E\u062A\u064E\u0670\u0639\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u065E \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064F \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u0650\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0642\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0641\u064E\u062A\u0650\u064A\u0644\u064B\u0627" }, { id: 78, text: "\u0623\u064E\u064A\u06E1\u0646\u064E\u0645\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u062F\u06E1\u0631\u0650\u0643\u0643\u0651\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0628\u064F\u0631\u064F\u0648\u062C\u0656 \u0645\u0651\u064F\u0634\u064E\u064A\u0651\u064E\u062F\u064E\u0629\u0656\u06D7 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0635\u0650\u0628\u06E1\u0647\u064F\u0645\u06E1 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u065E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0635\u0650\u0628\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u065E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0643\u064E\u06DA \u0642\u064F\u0644\u06E1 \u0643\u064F\u0644\u0651\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0641\u064E\u0645\u064E\u0627\u0644\u0650 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064E\u0627 \u064A\u064E\u0643\u064E\u0627\u062F\u064F\u0648\u0646\u064E \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E \u062D\u064E\u062F\u0650\u064A\u062B\u0657\u0627" }, { id: 79, text: "\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0643\u064E \u0645\u0650\u0646\u06E1 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0656 \u0641\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0643\u064E \u0645\u0650\u0646 \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0656 \u0641\u064E\u0645\u0650\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0650\u0643\u064E\u06DA \u0648\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u0647\u0650\u064A\u062F\u0657\u0627" }, { id: 80, text: "\u0645\u0651\u064E\u0646 \u064A\u064F\u0637\u0650\u0639\u0650 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0641\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0637\u064E\u0627\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06D6 \u0648\u064E\u0645\u064E\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062D\u064E\u0641\u0650\u064A\u0638\u0657\u0627" }, { id: 81, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0637\u064E\u0627\u0639\u064E\u0629\u065E \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0631\u064E\u0632\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0643\u064E \u0628\u064E\u064A\u0651\u064E\u062A\u064E \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0643\u06E1\u062A\u064F\u0628\u064F \u0645\u064E\u0627 \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u062A\u064F\u0648\u0646\u064E\u06D6 \u0641\u064E\u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u0650\u064A\u0644\u064B\u0627" }, { id: 82, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u062A\u064E\u062F\u064E\u0628\u0651\u064E\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0648\u064E\u062C\u064E\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0671\u062E\u06E1\u062A\u0650\u0644\u064E\u0670\u0641\u0657\u0627 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627" }, { id: 83, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0631\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0646\u0650 \u0623\u064E\u0648\u0650 \u0671\u0644\u06E1\u062E\u064E\u0648\u06E1\u0641\u0650 \u0623\u064E\u0630\u064E\u0627\u0639\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0631\u064E\u062F\u0651\u064F\u0648\u0647\u064F \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0648\u064E\u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0650\u0645\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0633\u06E1\u062A\u064E\u0646\u06E2\u0628\u0650\u0637\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064F\u0647\u064F\u06E5 \u0644\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 84, text: "\u0641\u064E\u0642\u064E\u0670\u062A\u0650\u0644\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u062A\u064F\u0643\u064E\u0644\u0651\u064E\u0641\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u0641\u06E1\u0633\u064E\u0643\u064E\u06DA \u0648\u064E\u062D\u064E\u0631\u0651\u0650\u0636\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E\u06D6 \u0639\u064E\u0633\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0641\u0651\u064E \u0628\u064E\u0623\u06E1\u0633\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0628\u064E\u0623\u06E1\u0633\u0657\u0627 \u0648\u064E\u0623\u064E\u0634\u064E\u062F\u0651\u064F \u062A\u064E\u0646\u0643\u0650\u064A\u0644\u0657\u0627" }, { id: 85, text: "\u0645\u0651\u064E\u0646 \u064A\u064E\u0634\u06E1\u0641\u064E\u0639\u06E1 \u0634\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u064B \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0657 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0646\u064E\u0635\u0650\u064A\u0628\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0634\u06E1\u0641\u064E\u0639\u06E1 \u0634\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u0657 \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0657 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0643\u0650\u0641\u06E1\u0644\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u064F\u0642\u0650\u064A\u062A\u0657\u0627" }, { id: 86, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062D\u064F\u064A\u0651\u0650\u064A\u062A\u064F\u0645 \u0628\u0650\u062A\u064E\u062D\u0650\u064A\u0651\u064E\u0629\u0656 \u0641\u064E\u062D\u064E\u064A\u0651\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0631\u064F\u062F\u0651\u064F\u0648\u0647\u064E\u0627\u0653\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u062D\u064E\u0633\u0650\u064A\u0628\u064B\u0627" }, { id: 87, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06DA \u0644\u064E\u064A\u064E\u062C\u06E1\u0645\u064E\u0639\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0644\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u0650\u06D7 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0635\u06E1\u062F\u064E\u0642\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u062F\u0650\u064A\u062B\u0657\u0627" }, { id: 88, text: "\u06DE\u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0641\u0650\u0626\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0631\u06E1\u0643\u064E\u0633\u064E\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0653\u0627\u0652\u06DA \u0623\u064E\u062A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u062A\u064E\u0647\u06E1\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0644\u064E\u0647\u064F\u06E5 \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 89, text: "\u0648\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0643\u064E\u0645\u064E\u0627 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0646\u064E \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0657\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0647\u064E\u0627\u062C\u0650\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u062E\u064F\u0630\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0647\u064F\u0645\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0648\u064E\u062C\u064E\u062F\u062A\u0651\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u064B\u0627" }, { id: 90, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0635\u0650\u0644\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u06ED \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u064A\u062B\u064E\u0670\u0642\u064C \u0623\u064E\u0648\u06E1 \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0643\u064F\u0645\u06E1 \u062D\u064E\u0635\u0650\u0631\u064E\u062A\u06E1 \u0635\u064F\u062F\u064F\u0648\u0631\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0633\u064E\u0644\u0651\u064E\u0637\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0642\u064E\u0670\u062A\u064E\u0644\u064F\u0648\u0643\u064F\u0645\u06E1\u06DA \u0641\u064E\u0625\u0650\u0646\u0650 \u0671\u0639\u06E1\u062A\u064E\u0632\u064E\u0644\u064F\u0648\u0643\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0645\u064E \u0641\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 91, text: "\u0633\u064E\u062A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u0645\u064E\u0646\u064F\u0648\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0623\u06E1\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u0645\u06E1 \u0643\u064F\u0644\u0651\u064E \u0645\u064E\u0627 \u0631\u064F\u062F\u0651\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0650 \u0623\u064F\u0631\u06E1\u0643\u0650\u0633\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0639\u06E1\u062A\u064E\u0632\u0650\u0644\u064F\u0648\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u0644\u06E1\u0642\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0645\u064E \u0648\u064E\u064A\u064E\u0643\u064F\u0641\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u062E\u064F\u0630\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0647\u064F\u0645\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u062B\u064E\u0642\u0650\u0641\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064F\u0645\u06E1 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 92, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064D \u0623\u064E\u0646 \u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u062E\u064E\u0637\u064E\u0640\u0654\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0646 \u0642\u064E\u062A\u064E\u0644\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064B\u0627 \u062E\u064E\u0637\u064E\u0640\u0654\u0657\u0627 \u0641\u064E\u062A\u064E\u062D\u06E1\u0631\u0650\u064A\u0631\u064F \u0631\u064E\u0642\u064E\u0628\u064E\u0629\u0656 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0629\u0656 \u0648\u064E\u062F\u0650\u064A\u064E\u0629\u065E \u0645\u0651\u064F\u0633\u064E\u0644\u0651\u064E\u0645\u064E\u0629\u064C \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0635\u0651\u064E\u062F\u0651\u064E\u0642\u064F\u0648\u0627\u0652\u06DA \u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u062F\u064F\u0648\u0651\u0656 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u065E \u0641\u064E\u062A\u064E\u062D\u06E1\u0631\u0650\u064A\u0631\u064F \u0631\u064E\u0642\u064E\u0628\u064E\u0629\u0656 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0629\u0656\u06D6 \u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u06ED \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u064A\u062B\u064E\u0670\u0642\u065E \u0641\u064E\u062F\u0650\u064A\u064E\u0629\u065E \u0645\u0651\u064F\u0633\u064E\u0644\u0651\u064E\u0645\u064E\u0629\u064C \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u062A\u064E\u062D\u06E1\u0631\u0650\u064A\u0631\u064F \u0631\u064E\u0642\u064E\u0628\u064E\u0629\u0656 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0629\u0656\u06D6 \u0641\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062C\u0650\u062F\u06E1 \u0641\u064E\u0635\u0650\u064A\u064E\u0627\u0645\u064F \u0634\u064E\u0647\u06E1\u0631\u064E\u064A\u06E1\u0646\u0650 \u0645\u064F\u062A\u064E\u062A\u064E\u0627\u0628\u0650\u0639\u064E\u064A\u06E1\u0646\u0650 \u062A\u064E\u0648\u06E1\u0628\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 93, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u06E1 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0657\u0627 \u0645\u0651\u064F\u062A\u064E\u0639\u064E\u0645\u0651\u0650\u062F\u0657\u0627 \u0641\u064E\u062C\u064E\u0632\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u06E5 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0657\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u063A\u064E\u0636\u0650\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0644\u064E\u0639\u064E\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 94, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0636\u064E\u0631\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0645\u064E\u0646\u06E1 \u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0670\u0645\u064E \u0644\u064E\u0633\u06E1\u062A\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0657\u0627 \u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0646\u064E \u0639\u064E\u0631\u064E\u0636\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0641\u064E\u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u063A\u064E\u0627\u0646\u0650\u0645\u064F \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u065E\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0641\u064E\u0645\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u064E\u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 95, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0670\u0639\u0650\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u063A\u064E\u064A\u06E1\u0631\u064F \u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u0636\u0651\u064E\u0631\u064E\u0631\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u062C\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1\u06DA \u0641\u064E\u0636\u0651\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u064E\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0670\u0639\u0650\u062F\u0650\u064A\u0646\u064E \u062F\u064E\u0631\u064E\u062C\u064E\u0629\u0657\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u0657\u0627 \u0648\u064E\u0639\u064E\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670\u06DA \u0648\u064E\u0641\u064E\u0636\u0651\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u064E\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0670\u0639\u0650\u062F\u0650\u064A\u0646\u064E \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 96, text: "\u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0657 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064B\u0627" }, { id: 97, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0638\u064E\u0627\u0644\u0650\u0645\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0645\u064E \u0643\u064F\u0646\u062A\u064F\u0645\u06E1\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064F\u0633\u06E1\u062A\u064E\u0636\u06E1\u0639\u064E\u0641\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0636\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0670\u0633\u0650\u0639\u064E\u0629\u0657 \u0641\u064E\u062A\u064F\u0647\u064E\u0627\u062C\u0650\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F\u06D6 \u0648\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0645\u064E\u0635\u0650\u064A\u0631\u064B\u0627" }, { id: 98, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0636\u06E1\u0639\u064E\u0641\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u062C\u064E\u0627\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0648\u0650\u0644\u06E1\u062F\u064E\u0670\u0646\u0650 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u062D\u0650\u064A\u0644\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 99, text: "\u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0639\u064E\u0633\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064E\u0639\u06E1\u0641\u064F\u0648\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0641\u064F\u0648\u0651\u064B\u0627 \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 100, text: "\u06DE\u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0647\u064E\u0627\u062C\u0650\u0631\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u062C\u0650\u062F\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064F\u0631\u064E\u0670\u063A\u064E\u0645\u0657\u0627 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0633\u064E\u0639\u064E\u0629\u0657\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u06E1 \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u062A\u0650\u0647\u0650\u06E6 \u0645\u064F\u0647\u064E\u0627\u062C\u0650\u0631\u064B\u0627 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u062F\u06E1\u0631\u0650\u0643\u06E1\u0647\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u0641\u064E\u0642\u064E\u062F\u06E1 \u0648\u064E\u0642\u064E\u0639\u064E \u0623\u064E\u062C\u06E1\u0631\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 101, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0636\u064E\u0631\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062C\u064F\u0646\u064E\u0627\u062D\u064C \u0623\u064E\u0646 \u062A\u064E\u0642\u06E1\u0635\u064F\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0625\u0650\u0646\u06E1 \u062E\u0650\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u0641\u06E1\u062A\u0650\u0646\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 102, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u064E\u0642\u064E\u0645\u06E1\u062A\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0641\u064E\u0644\u06E1\u062A\u064E\u0642\u064F\u0645\u06E1 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0639\u064E\u0643\u064E \u0648\u064E\u0644\u06E1\u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0633\u06E1\u0644\u0650\u062D\u064E\u062A\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u062C\u064E\u062F\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u06E1\u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u06E1\u062A\u064E\u0623\u06E1\u062A\u0650 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u064C \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670 \u0644\u064E\u0645\u06E1 \u064A\u064F\u0635\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u06E1\u064A\u064F\u0635\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0643\u064E \u0648\u064E\u0644\u06E1\u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0627\u0652 \u062D\u0650\u0630\u06E1\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0633\u06E1\u0644\u0650\u062D\u064E\u062A\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u062F\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u062A\u064E\u063A\u06E1\u0641\u064F\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0644\u0650\u062D\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0645\u06E1\u062A\u0650\u0639\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u064A\u064E\u0645\u0650\u064A\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u064E\u064A\u06E1\u0644\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657\u06DA \u0648\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0630\u0657\u0649 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0637\u064E\u0631\u064D \u0623\u064E\u0648\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064E\u0631\u06E1\u0636\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064E\u0636\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0633\u06E1\u0644\u0650\u062D\u064E\u062A\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u062E\u064F\u0630\u064F\u0648\u0627\u0652 \u062D\u0650\u0630\u06E1\u0631\u064E\u0643\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u0657\u0627" }, { id: 103, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0636\u064E\u064A\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0641\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u0650\u064A\u064E\u0670\u0645\u0657\u0627 \u0648\u064E\u0642\u064F\u0639\u064F\u0648\u062F\u0657\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u062C\u064F\u0646\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1\u06DA \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0637\u06E1\u0645\u064E\u0623\u06E1\u0646\u064E\u0646\u062A\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627 \u0645\u0651\u064E\u0648\u06E1\u0642\u064F\u0648\u062A\u0657\u0627" }, { id: 104, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0647\u0650\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650\u06D6 \u0625\u0650\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u062A\u064E\u0623\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0623\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0643\u064E\u0645\u064E\u0627 \u062A\u064E\u0623\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E\u06D6 \u0648\u064E\u062A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u064B\u0627" }, { id: 105, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u0650\u062A\u064E\u062D\u06E1\u0643\u064F\u0645\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0646 \u0644\u0651\u0650\u0644\u06E1\u062E\u064E\u0627\u0653\u0626\u0650\u0646\u0650\u064A\u0646\u064E \u062E\u064E\u0635\u0650\u064A\u0645\u0657\u0627" }, { id: 106, text: "\u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 107, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062E\u06E1\u062A\u064E\u0627\u0646\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u062E\u064E\u0648\u0651\u064E\u0627\u0646\u064B\u0627 \u0623\u064E\u062B\u0650\u064A\u0645\u0657\u0627" }, { id: 108, text: "\u064A\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0641\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0641\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u062A\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0645\u064F\u062D\u0650\u064A\u0637\u064B\u0627" }, { id: 109, text: "\u0647\u064E\u0640\u0670\u0653\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u062C\u064E\u0670\u062F\u064E\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0641\u064E\u0645\u064E\u0646 \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0623\u064E\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0643\u0650\u064A\u0644\u0657\u0627" }, { id: 110, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0633\u064F\u0648\u0653\u0621\u064B\u0627 \u0623\u064E\u0648\u06E1 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u06E1 \u0646\u064E\u0641\u06E1\u0633\u064E\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062C\u0650\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 111, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u06E1 \u0625\u0650\u062B\u06E1\u0645\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 112, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u06E1 \u062E\u064E\u0637\u0650\u064A\u0653\u0640\u0654\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u0625\u0650\u062B\u06E1\u0645\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0631\u06E1\u0645\u0650 \u0628\u0650\u0647\u0650\u06E6 \u0628\u064E\u0631\u0650\u064A\u0653\u0640\u0654\u0657\u0627 \u0641\u064E\u0642\u064E\u062F\u0650 \u0671\u062D\u06E1\u062A\u064E\u0645\u064E\u0644\u064E \u0628\u064F\u0647\u06E1\u062A\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0625\u0650\u062B\u06E1\u0645\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 113, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064F\u0647\u064F\u06E5 \u0644\u064E\u0647\u064E\u0645\u0651\u064E\u062A \u0637\u0651\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0648\u0643\u064E \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0648\u0646\u064E\u0643\u064E \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0648\u064E\u0639\u064E\u0644\u0651\u064E\u0645\u064E\u0643\u064E \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0646 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 114, text: "\u06DE\u0644\u0651\u064E\u0627 \u062E\u064E\u064A\u06E1\u0631\u064E \u0641\u0650\u064A \u0643\u064E\u062B\u0650\u064A\u0631\u0656 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u062C\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0645\u064E\u0631\u064E \u0628\u0650\u0635\u064E\u062F\u064E\u0642\u064E\u0629\u064D \u0623\u064E\u0648\u06E1 \u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u064D \u0623\u064E\u0648\u06E1 \u0625\u0650\u0635\u06E1\u0644\u064E\u0670\u062D\u0650\u06ED \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u06E1 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0631\u06E1\u0636\u064E\u0627\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u0646\u064F\u0624\u06E1\u062A\u0650\u064A\u0647\u0650 \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 115, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0634\u064E\u0627\u0642\u0650\u0642\u0650 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0648\u064E\u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0646\u064F\u0648\u064E\u0644\u0651\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0648\u064E\u0646\u064F\u0635\u06E1\u0644\u0650\u0647\u0650\u06E6 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E\u06D6 \u0648\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0645\u064E\u0635\u0650\u064A\u0631\u064B\u0627" }, { id: 116, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0623\u064E\u0646 \u064A\u064F\u0634\u06E1\u0631\u064E\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0645\u064E\u0627 \u062F\u064F\u0648\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u06E1 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064E \u0636\u064E\u0644\u064E\u0670\u0644\u064E\u06E2\u0627 \u0628\u064E\u0639\u0650\u064A\u062F\u064B\u0627" }, { id: 117, text: "\u0625\u0650\u0646 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0646\u064E\u0670\u062B\u0657\u0627 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0634\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0645\u0651\u064E\u0631\u0650\u064A\u062F\u0657\u0627" }, { id: 118, text: "\u0644\u0651\u064E\u0639\u064E\u0646\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D8 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0623\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0643\u064E \u0646\u064E\u0635\u0650\u064A\u0628\u0657\u0627 \u0645\u0651\u064E\u0641\u06E1\u0631\u064F\u0648\u0636\u0657\u0627" }, { id: 119, text: "\u0648\u064E\u0644\u064E\u0623\u064F\u0636\u0650\u0644\u0651\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0623\u064F\u0645\u064E\u0646\u0651\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0623\u0653\u0645\u064F\u0631\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u064A\u064F\u0628\u064E\u062A\u0651\u0650\u0643\u064F\u0646\u0651\u064E \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0648\u064E\u0644\u064E\u0623\u0653\u0645\u064F\u0631\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u064A\u064F\u063A\u064E\u064A\u0651\u0650\u0631\u064F\u0646\u0651\u064E \u062E\u064E\u0644\u06E1\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064E \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0633\u0650\u0631\u064E \u062E\u064F\u0633\u06E1\u0631\u064E\u0627\u0646\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 120, text: "\u064A\u064E\u0639\u0650\u062F\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u0645\u064E\u0646\u0651\u0650\u064A\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u0650\u062F\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u063A\u064F\u0631\u064F\u0648\u0631\u064B\u0627" }, { id: 121, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0645\u064E\u062D\u0650\u064A\u0635\u0657\u0627" }, { id: 122, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0633\u064E\u0646\u064F\u062F\u06E1\u062E\u0650\u0644\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06D6 \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0635\u06E1\u062F\u064E\u0642\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0642\u0650\u064A\u0644\u0657\u0627" }, { id: 123, text: "\u0644\u0651\u064E\u064A\u06E1\u0633\u064E \u0628\u0650\u0623\u064E\u0645\u064E\u0627\u0646\u0650\u064A\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0645\u064E\u0627\u0646\u0650\u064A\u0651\u0650 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650\u06D7 \u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0633\u064F\u0648\u0653\u0621\u0657\u0627 \u064A\u064F\u062C\u06E1\u0632\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 124, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0645\u0650\u0646 \u0630\u064E\u0643\u064E\u0631\u064D \u0623\u064E\u0648\u06E1 \u0623\u064F\u0646\u062B\u064E\u0649\u0670 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u065E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0646\u064E\u0642\u0650\u064A\u0631\u0657\u0627" }, { id: 125, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u062F\u0650\u064A\u0646\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u064E \u0648\u064E\u062C\u06E1\u0647\u064E\u0647\u064F\u06E5 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u065E \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0645\u0650\u0644\u0651\u064E\u0629\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u062D\u064E\u0646\u0650\u064A\u0641\u0657\u0627\u06D7 \u0648\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u062E\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 126, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u064F\u062D\u0650\u064A\u0637\u0657\u0627" }, { id: 127, text: "\u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u0641\u06E1\u062A\u064F\u0648\u0646\u064E\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650\u06D6 \u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0641\u06E1\u062A\u0650\u064A\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0641\u0650\u064A \u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649 \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0651\u064E\u0640\u0670\u062A\u0650\u064A \u0644\u064E\u0627 \u062A\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u064E\u0647\u064F\u0646\u0651\u064E \u0645\u064E\u0627 \u0643\u064F\u062A\u0650\u0628\u064E \u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u062A\u064E\u0631\u06E1\u063A\u064E\u0628\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u062A\u064E\u0646\u0643\u0650\u062D\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0636\u06E1\u0639\u064E\u0641\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0648\u0650\u0644\u06E1\u062F\u064E\u0670\u0646\u0650 \u0648\u064E\u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0645\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 128, text: "\u0648\u064E\u0625\u0650\u0646\u0650 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u0629\u064C \u062E\u064E\u0627\u0641\u064E\u062A\u06E1 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u0644\u0650\u0647\u064E\u0627 \u0646\u064F\u0634\u064F\u0648\u0632\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0625\u0650\u0639\u06E1\u0631\u064E\u0627\u0636\u0657\u0627 \u0641\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u0635\u06E1\u0644\u0650\u062D\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0635\u064F\u0644\u06E1\u062D\u0657\u0627\u06DA \u0648\u064E\u0671\u0644\u0635\u0651\u064F\u0644\u06E1\u062D\u064F \u062E\u064E\u064A\u06E1\u0631\u065E\u06D7 \u0648\u064E\u0623\u064F\u062D\u06E1\u0636\u0650\u0631\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0646\u0641\u064F\u0633\u064F \u0671\u0644\u0634\u0651\u064F\u062D\u0651\u064E\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u062D\u06E1\u0633\u0650\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 129, text: "\u0648\u064E\u0644\u064E\u0646 \u062A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u062A\u064E\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0644\u064E\u0648\u06E1 \u062D\u064E\u0631\u064E\u0635\u06E1\u062A\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u0650\u064A\u0644\u064F\u0648\u0627\u0652 \u0643\u064F\u0644\u0651\u064E \u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u0644\u0650 \u0641\u064E\u062A\u064E\u0630\u064E\u0631\u064F\u0648\u0647\u064E\u0627 \u0643\u064E\u0671\u0644\u06E1\u0645\u064F\u0639\u064E\u0644\u0651\u064E\u0642\u064E\u0629\u0650\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0635\u06E1\u0644\u0650\u062D\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 130, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u062A\u064E\u0641\u064E\u0631\u0651\u064E\u0642\u064E\u0627 \u064A\u064F\u063A\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0643\u064F\u0644\u0651\u0657\u0627 \u0645\u0651\u0650\u0646 \u0633\u064E\u0639\u064E\u062A\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0670\u0633\u0650\u0639\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 131, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0648\u064E\u0635\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u064A\u0651\u064E\u0627\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0646\u0650\u064A\u0651\u064B\u0627 \u062D\u064E\u0645\u0650\u064A\u062F\u0657\u0627" }, { id: 132, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u0650\u064A\u0644\u064B\u0627" }, { id: 133, text: "\u0625\u0650\u0646 \u064A\u064E\u0634\u064E\u0623\u06E1 \u064A\u064F\u0630\u06E1\u0647\u0650\u0628\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0648\u064E\u064A\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u0640\u0654\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0642\u064E\u062F\u0650\u064A\u0631\u0657\u0627" }, { id: 134, text: "\u0645\u0651\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u062B\u064E\u0648\u064E\u0627\u0628\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0641\u064E\u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064E\u0648\u064E\u0627\u0628\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064E\u06E2\u0627 \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 135, text: "\u06DE\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u0651\u064E\u0640\u0670\u0645\u0650\u064A\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u0650 \u0671\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u0650\u064A\u0646\u064E\u06DA \u0625\u0650\u0646 \u064A\u064E\u0643\u064F\u0646\u06E1 \u063A\u064E\u0646\u0650\u064A\u0651\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0641\u064E\u0642\u0650\u064A\u0631\u0657\u0627 \u0641\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0628\u0650\u0647\u0650\u0645\u064E\u0627\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0647\u064E\u0648\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064E\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0644\u06E1\u0648\u064F\u06E5\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1 \u062A\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 136, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u06E1 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0643\u064F\u062A\u064F\u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064E \u0636\u064E\u0644\u064E\u0670\u0644\u064E\u06E2\u0627 \u0628\u064E\u0639\u0650\u064A\u062F\u064B\u0627" }, { id: 137, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u062B\u064F\u0645\u0651\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u062B\u064F\u0645\u0651\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u062B\u064F\u0645\u0651\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u062B\u064F\u0645\u0651\u064E \u0671\u0632\u06E1\u062F\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0643\u064F\u0641\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0644\u0650\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u0628\u0650\u064A\u0644\u064E\u06E2\u0627" }, { id: 138, text: "\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u064B\u0627" }, { id: 139, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E\u06DA \u0623\u064E\u064A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0646\u064E \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u0650\u0632\u0651\u064E\u0629\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0639\u0650\u0632\u0651\u064E\u0629\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627" }, { id: 140, text: "\u0648\u064E\u0642\u064E\u062F\u06E1 \u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0623\u064E\u0646\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u06E1\u062A\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064F\u0643\u06E1\u0641\u064E\u0631\u064F \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u064A\u064F\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u064E\u0623\u064F \u0628\u0650\u0647\u064E\u0627 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0639\u064F\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u062E\u064F\u0648\u0636\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062D\u064E\u062F\u0650\u064A\u062B\u064D \u063A\u064E\u064A\u06E1\u0631\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u0657\u0627 \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0647\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062C\u064E\u0627\u0645\u0650\u0639\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627" }, { id: 141, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u064F\u0648\u0646\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u062A\u06E1\u062D\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u0643\u064F\u0646 \u0645\u0651\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0646\u064E\u0635\u0650\u064A\u0628\u065E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u0633\u06E1\u062A\u064E\u062D\u06E1\u0648\u0650\u0630\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0646\u064E\u0645\u06E1\u0646\u064E\u0639\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E\u06DA \u0641\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06DA \u0648\u064E\u0644\u064E\u0646 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u064B\u0627" }, { id: 142, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u064A\u064F\u062E\u064E\u0670\u062F\u0650\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u0670\u062F\u0650\u0639\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0627\u0645\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0643\u064F\u0633\u064E\u0627\u0644\u064E\u0649\u0670 \u064A\u064F\u0631\u064E\u0627\u0653\u0621\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 143, text: "\u0645\u0651\u064F\u0630\u064E\u0628\u06E1\u0630\u064E\u0628\u0650\u064A\u0646\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0644\u064E\u0647\u064F\u06E5 \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 144, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E\u06DA \u0623\u064E\u062A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064B\u0627" }, { id: 145, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064E\u0631\u06E1\u0643\u0650 \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0641\u064E\u0644\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0648\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0635\u0650\u064A\u0631\u064B\u0627" }, { id: 146, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0639\u06E1\u062A\u064E\u0635\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u062E\u06E1\u0644\u064E\u0635\u064F\u0648\u0627\u0652 \u062F\u0650\u064A\u0646\u064E\u0647\u064F\u0645\u06E1 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E\u06D6 \u0648\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064F\u0624\u06E1\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 147, text: "\u0645\u0651\u064E\u0627 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0634\u064E\u0643\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0634\u064E\u0627\u0643\u0650\u0631\u064B\u0627 \u0639\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 148, text: "\u06DE\u0644\u0651\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062C\u064E\u0647\u06E1\u0631\u064E \u0628\u0650\u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0638\u064F\u0644\u0650\u0645\u064E\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064B\u0627 \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627" }, { id: 149, text: "\u0625\u0650\u0646 \u062A\u064F\u0628\u06E1\u062F\u064F\u0648\u0627\u0652 \u062E\u064E\u064A\u06E1\u0631\u064B\u0627 \u0623\u064E\u0648\u06E1 \u062A\u064F\u062E\u06E1\u0641\u064F\u0648\u0647\u064F \u0623\u064E\u0648\u06E1 \u062A\u064E\u0639\u06E1\u0641\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064F\u0648\u0653\u0621\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0641\u064F\u0648\u0651\u0657\u0627 \u0642\u064E\u062F\u0650\u064A\u0631\u064B\u0627" }, { id: 150, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064F\u0641\u064E\u0631\u0651\u0650\u0642\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0646\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0648\u064E\u0646\u064E\u0643\u06E1\u0641\u064F\u0631\u064F \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0648\u064E\u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u064B\u0627" }, { id: 151, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u062D\u064E\u0642\u0651\u0657\u0627\u06DA \u0648\u064E\u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u0657\u0627" }, { id: 152, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0641\u064E\u0631\u0651\u0650\u0642\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 153, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064E \u0623\u064E\u0647\u06E1\u0644\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0623\u064E\u0646 \u062A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650\u06DA \u0641\u064E\u0642\u064E\u062F\u06E1 \u0633\u064E\u0623\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064E \u0645\u0650\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0631\u0650\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062C\u064E\u0647\u06E1\u0631\u064E\u0629\u0657 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0639\u0650\u0642\u064E\u0629\u064F \u0628\u0650\u0638\u064F\u0644\u06E1\u0645\u0650\u0647\u0650\u0645\u06E1\u06DA \u062B\u064F\u0645\u0651\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u062C\u06E1\u0644\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u064F \u0641\u064E\u0639\u064E\u0641\u064E\u0648\u06E1\u0646\u064E\u0627 \u0639\u064E\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06DA \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 154, text: "\u0648\u064E\u0631\u064E\u0641\u064E\u0639\u06E1\u0646\u064E\u0627 \u0641\u064E\u0648\u06E1\u0642\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0637\u0651\u064F\u0648\u0631\u064E \u0628\u0650\u0645\u0650\u064A\u062B\u064E\u0670\u0642\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0628\u064E\u0627\u0628\u064E \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627 \u0648\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0628\u06E1\u062A\u0650 \u0648\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u0650\u064A\u062B\u064E\u0670\u0642\u064B\u0627 \u063A\u064E\u0644\u0650\u064A\u0638\u0657\u0627" }, { id: 155, text: "\u0641\u064E\u0628\u0650\u0645\u064E\u0627 \u0646\u064E\u0642\u06E1\u0636\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u064A\u062B\u064E\u0670\u0642\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0643\u064F\u0641\u06E1\u0631\u0650\u0647\u0650\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0642\u064E\u062A\u06E1\u0644\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E2\u0628\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u064E\u0642\u0651\u0656 \u0648\u064E\u0642\u064E\u0648\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0646\u064E\u0627 \u063A\u064F\u0644\u06E1\u0641\u064F\u06E2\u06DA \u0628\u064E\u0644\u06E1 \u0637\u064E\u0628\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0628\u0650\u0643\u064F\u0641\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 156, text: "\u0648\u064E\u0628\u0650\u0643\u064F\u0641\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0642\u064E\u0648\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0628\u064F\u0647\u06E1\u062A\u064E\u0670\u0646\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 157, text: "\u0648\u064E\u0642\u064E\u0648\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0627 \u0642\u064E\u062A\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064E \u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064E \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627 \u0642\u064E\u062A\u064E\u0644\u064F\u0648\u0647\u064F \u0648\u064E\u0645\u064E\u0627 \u0635\u064E\u0644\u064E\u0628\u064F\u0648\u0647\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0634\u064F\u0628\u0651\u0650\u0647\u064E \u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0644\u064E\u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u06DA \u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0644\u06E1\u0645\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u062A\u0651\u0650\u0628\u064E\u0627\u0639\u064E \u0671\u0644\u0638\u0651\u064E\u0646\u0651\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u0642\u064E\u062A\u064E\u0644\u064F\u0648\u0647\u064F \u064A\u064E\u0642\u0650\u064A\u0646\u064E\u06E2\u0627" }, { id: 158, text: "\u0628\u064E\u0644 \u0631\u0651\u064E\u0641\u064E\u0639\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 159, text: "\u0648\u064E\u0625\u0650\u0646 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u064E\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0646\u0651\u064E \u0628\u0650\u0647\u0650\u06E6 \u0642\u064E\u0628\u06E1\u0644\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0634\u064E\u0647\u0650\u064A\u062F\u0657\u0627" }, { id: 160, text: "\u0641\u064E\u0628\u0650\u0638\u064F\u0644\u06E1\u0645\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u062D\u064E\u0631\u0651\u064E\u0645\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u064D \u0623\u064F\u062D\u0650\u0644\u0651\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0628\u0650\u0635\u064E\u062F\u0651\u0650\u0647\u0650\u0645\u06E1 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627" }, { id: 161, text: "\u0648\u064E\u0623\u064E\u062E\u06E1\u0630\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0631\u0651\u0650\u0628\u064E\u0648\u0670\u0627\u0652 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0646\u064F\u0647\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F \u0648\u064E\u0623\u064E\u0643\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650\u06DA \u0648\u064E\u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 162, text: "\u0644\u0651\u064E\u0640\u0670\u0643\u0650\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0633\u0650\u062E\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E\u06DA \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0642\u0650\u064A\u0645\u0650\u064A\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E\u06DA \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0633\u064E\u0646\u064F\u0624\u06E1\u062A\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u064B\u0627" }, { id: 163, text: "\u06DE\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0628\u064E\u0627\u0637\u0650 \u0648\u064E\u0639\u0650\u064A\u0633\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u064A\u0651\u064F\u0648\u0628\u064E \u0648\u064E\u064A\u064F\u0648\u0646\u064F\u0633\u064E \u0648\u064E\u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0648\u064E\u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u06DA \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0632\u064E\u0628\u064F\u0648\u0631\u0657\u0627" }, { id: 164, text: "\u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0657\u0627 \u0642\u064E\u062F\u06E1 \u0642\u064E\u0635\u064E\u0635\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0657\u0627 \u0644\u0651\u064E\u0645\u06E1 \u0646\u064E\u0642\u06E1\u0635\u064F\u0635\u06E1\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E\u06DA \u0648\u064E\u0643\u064E\u0644\u0651\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u062A\u064E\u0643\u06E1\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 165, text: "\u0631\u0651\u064F\u0633\u064F\u0644\u0657\u0627 \u0645\u0651\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0645\u064F\u0646\u0630\u0650\u0631\u0650\u064A\u0646\u064E \u0644\u0650\u0626\u064E\u0644\u0651\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064F\u062C\u0651\u064E\u0629\u064F\u06E2 \u0628\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 166, text: "\u0644\u0651\u064E\u0640\u0670\u0643\u0650\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0623\u064E\u0646\u0632\u064E\u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0639\u0650\u0644\u06E1\u0645\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u0647\u0650\u064A\u062F\u064B\u0627" }, { id: 167, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0635\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0636\u064E\u0644\u064E\u0670\u0644\u064E\u06E2\u0627 \u0628\u064E\u0639\u0650\u064A\u062F\u064B\u0627" }, { id: 168, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0644\u0650\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0637\u064E\u0631\u0650\u064A\u0642\u064B\u0627" }, { id: 169, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0637\u064E\u0631\u0650\u064A\u0642\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0633\u0650\u064A\u0631\u0657\u0627" }, { id: 170, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0640\u0654\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 171, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0627 \u062A\u064E\u063A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062F\u0650\u064A\u0646\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064F \u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u064E\u0644\u0650\u0645\u064E\u062A\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0648\u064E\u0631\u064F\u0648\u062D\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u06D6 \u0641\u064E\u0640\u0654\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u064C\u06DA \u0671\u0646\u062A\u064E\u0647\u064F\u0648\u0627\u0652 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E\u06D6 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u062F\u065E\u06D8 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u0650\u064A\u0644\u0657\u0627" }, { id: 172, text: "\u0644\u0651\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0646\u0643\u0650\u0641\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064F \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0639\u064E\u0628\u06E1\u062F\u0657\u0627 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0631\u0651\u064E\u0628\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0646\u0643\u0650\u0641\u06E1 \u0639\u064E\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u06E1 \u0641\u064E\u0633\u064E\u064A\u064E\u062D\u06E1\u0634\u064F\u0631\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627" }, { id: 173, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0641\u064E\u064A\u064F\u0648\u064E\u0641\u0651\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0632\u0650\u064A\u062F\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u0646\u0643\u064E\u0641\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 174, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645 \u0628\u064F\u0631\u06E1\u0647\u064E\u0670\u0646\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0646\u064F\u0648\u0631\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 175, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0639\u06E1\u062A\u064E\u0635\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u0633\u064E\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u0641\u064E\u0636\u06E1\u0644\u0656 \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0635\u0650\u0631\u064E\u0670\u0637\u0657\u0627 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0657\u0627" }, { id: 176, text: "\u064A\u064E\u0633\u06E1\u062A\u064E\u0641\u06E1\u062A\u064F\u0648\u0646\u064E\u0643\u064E \u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0641\u06E1\u062A\u0650\u064A\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u064E\u0644\u064E\u0670\u0644\u064E\u0629\u0650\u06DA \u0625\u0650\u0646\u0650 \u0671\u0645\u06E1\u0631\u064F\u0624\u064C\u0627\u0652 \u0647\u064E\u0644\u064E\u0643\u064E \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u062F\u065E \u0648\u064E\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064F\u062E\u06E1\u062A\u065E \u0641\u064E\u0644\u064E\u0647\u064E\u0627 \u0646\u0650\u0635\u06E1\u0641\u064F \u0645\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064E\u0631\u0650\u062B\u064F\u0647\u064E\u0627\u0653 \u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u062F\u065E\u06DA \u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E\u062A\u064E\u0627 \u0671\u062B\u06E1\u0646\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u0644\u064E\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u062B\u0651\u064F\u0644\u064F\u062B\u064E\u0627\u0646\u0650 \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E\u06DA \u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u062E\u06E1\u0648\u064E\u0629\u0657 \u0631\u0651\u0650\u062C\u064E\u0627\u0644\u0657\u0627 \u0648\u064E\u0646\u0650\u0633\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0644\u0650\u0644\u0630\u0651\u064E\u0643\u064E\u0631\u0650 \u0645\u0650\u062B\u06E1\u0644\u064F \u062D\u064E\u0638\u0651\u0650 \u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u064A\u064E\u064A\u06E1\u0646\u0650\u06D7 \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0636\u0650\u0644\u0651\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2" }] }, { id: 5, name: "\u0627\u0644\u0645\u0627\u0626\u062F\u0629", transliteration: "Al-Ma'idah", type: "medinan", total_verses: 120, verses: [{ id: 1, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1\u0641\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0639\u064F\u0642\u064F\u0648\u062F\u0650\u06DA \u0623\u064F\u062D\u0650\u0644\u0651\u064E\u062A\u06E1 \u0644\u064E\u0643\u064F\u0645 \u0628\u064E\u0647\u0650\u064A\u0645\u064E\u0629\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u064A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u062D\u0650\u0644\u0651\u0650\u064A \u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u062F\u0650 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062D\u064F\u0631\u064F\u0645\u064C\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F" }, { id: 2, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064F\u062D\u0650\u0644\u0651\u064F\u0648\u0627\u0652 \u0634\u064E\u0639\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u0647\u06E1\u0631\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u064E \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u06E1\u0647\u064E\u062F\u06E1\u064A\u064E \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u062F\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0621\u064E\u0627\u0653\u0645\u0651\u0650\u064A\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u064E \u064A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0646\u064E \u0641\u064E\u0636\u06E1\u0644\u0657\u0627 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u0657\u0627\u06DA \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062D\u064E\u0644\u064E\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0671\u0635\u06E1\u0637\u064E\u0627\u062F\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062C\u06E1\u0631\u0650\u0645\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0634\u064E\u0646\u064E\u0640\u0654\u064E\u0627\u0646\u064F \u0642\u064E\u0648\u06E1\u0645\u064D \u0623\u064E\u0646 \u0635\u064E\u062F\u0651\u064F\u0648\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650 \u0623\u064E\u0646 \u062A\u064E\u0639\u06E1\u062A\u064E\u062F\u064F\u0648\u0627\u0652\u06D8 \u0648\u064E\u062A\u064E\u0639\u064E\u0627\u0648\u064E\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0628\u0650\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u064E\u0627\u0648\u064E\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064F\u062F\u06E1\u0648\u064E\u0670\u0646\u0650\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 3, text: "\u062D\u064F\u0631\u0651\u0650\u0645\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u062A\u064E\u0629\u064F \u0648\u064E\u0671\u0644\u062F\u0651\u064E\u0645\u064F \u0648\u064E\u0644\u064E\u062D\u06E1\u0645\u064F \u0671\u0644\u06E1\u062E\u0650\u0646\u0632\u0650\u064A\u0631\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0647\u0650\u0644\u0651\u064E \u0644\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u06E1\u062E\u064E\u0646\u0650\u0642\u064E\u0629\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u0642\u064F\u0648\u0630\u064E\u0629\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0631\u064E\u062F\u0651\u0650\u064A\u064E\u0629\u064F \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0637\u0650\u064A\u062D\u064E\u0629\u064F \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0643\u064E\u0644\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u064F\u0639\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0630\u064E\u0643\u0651\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0630\u064F\u0628\u0650\u062D\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064F\u0635\u064F\u0628\u0650 \u0648\u064E\u0623\u064E\u0646 \u062A\u064E\u0633\u06E1\u062A\u064E\u0642\u06E1\u0633\u0650\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0632\u06E1\u0644\u064E\u0670\u0645\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0641\u0650\u0633\u06E1\u0642\u064C\u06D7 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0626\u0650\u0633\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u0650\u064A\u0646\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u0650\u06DA \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0623\u064E\u0643\u06E1\u0645\u064E\u0644\u06E1\u062A\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u062F\u0650\u064A\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u062A\u06E1\u0645\u064E\u0645\u06E1\u062A\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u0650\u064A \u0648\u064E\u0631\u064E\u0636\u0650\u064A\u062A\u064F \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0625\u0650\u0633\u06E1\u0644\u064E\u0670\u0645\u064E \u062F\u0650\u064A\u0646\u0657\u0627\u06DA \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0636\u06E1\u0637\u064F\u0631\u0651\u064E \u0641\u0650\u064A \u0645\u064E\u062E\u06E1\u0645\u064E\u0635\u064E\u0629\u064D \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u062A\u064E\u062C\u064E\u0627\u0646\u0650\u0641\u0656 \u0644\u0651\u0650\u0625\u0650\u062B\u06E1\u0645\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 4, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0645\u064E\u0627\u0630\u064E\u0627\u0653 \u0623\u064F\u062D\u0650\u0644\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0642\u064F\u0644\u06E1 \u0623\u064F\u062D\u0650\u0644\u0651\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u064F \u0648\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u0651\u064E\u0645\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0648\u064E\u0627\u0631\u0650\u062D\u0650 \u0645\u064F\u0643\u064E\u0644\u0651\u0650\u0628\u0650\u064A\u0646\u064E \u062A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0648\u0646\u064E\u0647\u064F\u0646\u0651\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u0639\u064E\u0644\u0651\u064E\u0645\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0641\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0633\u064E\u0643\u06E1\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0633\u06E1\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0631\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 5, text: "\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0623\u064F\u062D\u0650\u0644\u0651\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u064F\u06D6 \u0648\u064E\u0637\u064E\u0639\u064E\u0627\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u062D\u0650\u0644\u0651\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0637\u064E\u0639\u064E\u0627\u0645\u064F\u0643\u064F\u0645\u06E1 \u062D\u0650\u0644\u0651\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0635\u064E\u0646\u064E\u0670\u062A\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0635\u064E\u0646\u064E\u0670\u062A\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064F\u0646\u0651\u064E \u0645\u064F\u062D\u06E1\u0635\u0650\u0646\u0650\u064A\u0646\u064E \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u0633\u064E\u0670\u0641\u0650\u062D\u0650\u064A\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u0645\u064F\u062A\u0651\u064E\u062E\u0650\u0630\u0650\u064A\u0653 \u0623\u064E\u062E\u06E1\u062F\u064E\u0627\u0646\u0656\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u06E1 \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650 \u0641\u064E\u0642\u064E\u062F\u06E1 \u062D\u064E\u0628\u0650\u0637\u064E \u0639\u064E\u0645\u064E\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 6, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0642\u064F\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0641\u064E\u0671\u063A\u06E1\u0633\u0650\u0644\u064F\u0648\u0627\u0652 \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0631\u064E\u0627\u0641\u0650\u0642\u0650 \u0648\u064E\u0671\u0645\u06E1\u0633\u064E\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u064F\u0621\u064F\u0648\u0633\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0639\u06E1\u0628\u064E\u064A\u06E1\u0646\u0650\u06DA \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062C\u064F\u0646\u064F\u0628\u0657\u0627 \u0641\u064E\u0671\u0637\u0651\u064E\u0647\u0651\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064E\u0631\u06E1\u0636\u064E\u0649\u0670\u0653 \u0623\u064E\u0648\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064E\u0641\u064E\u0631\u064D \u0623\u064E\u0648\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u062D\u064E\u062F\u065E \u0645\u0651\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0627\u0653\u0626\u0650\u0637\u0650 \u0623\u064E\u0648\u06E1 \u0644\u064E\u0670\u0645\u064E\u0633\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u062A\u064E\u064A\u064E\u0645\u0651\u064E\u0645\u064F\u0648\u0627\u0652 \u0635\u064E\u0639\u0650\u064A\u062F\u0657\u0627 \u0637\u064E\u064A\u0651\u0650\u0628\u0657\u0627 \u0641\u064E\u0671\u0645\u06E1\u0633\u064E\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0648\u064F\u062C\u064F\u0648\u0647\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u06DA \u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u0631\u064E\u062C\u0656 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0644\u0650\u064A\u064F\u0637\u064E\u0647\u0651\u0650\u0631\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u064A\u064F\u062A\u0650\u0645\u0651\u064E \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0648\u064E\u0627\u062B\u064E\u0642\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0630\u06E1 \u0642\u064F\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 8, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u0651\u064E\u0640\u0670\u0645\u0650\u064A\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062C\u06E1\u0631\u0650\u0645\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0634\u064E\u0646\u064E\u0640\u0654\u064E\u0627\u0646\u064F \u0642\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0627\u0652\u06DA \u0671\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0627\u0652 \u0647\u064F\u0648\u064E \u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F \u0644\u0650\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0639\u064E\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0623\u064E\u062C\u06E1\u0631\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 10, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 11, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u0647\u064E\u0645\u0651\u064E \u0642\u064E\u0648\u06E1\u0645\u064C \u0623\u064E\u0646 \u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0643\u064E\u0641\u0651\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u06DE\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0648\u064E\u0628\u064E\u0639\u064E\u062B\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1 \u0639\u064E\u0634\u064E\u0631\u064E \u0646\u064E\u0642\u0650\u064A\u0628\u0657\u0627\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0642\u064E\u0645\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0631\u064F\u0633\u064F\u0644\u0650\u064A \u0648\u064E\u0639\u064E\u0632\u0651\u064E\u0631\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0642\u06E1\u0631\u064E\u0636\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u0631\u06E1\u0636\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627 \u0644\u0651\u064E\u0623\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u064E\u0646\u0651\u064E \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0623\u064F\u062F\u06E1\u062E\u0650\u0644\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06DA \u0641\u064E\u0645\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064E \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650" }, { id: 13, text: "\u0641\u064E\u0628\u0650\u0645\u064E\u0627 \u0646\u064E\u0642\u06E1\u0636\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u064A\u062B\u064E\u0670\u0642\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0646\u0651\u064E\u0640\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0642\u064F\u0644\u064F\u0648\u0628\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0670\u0633\u0650\u064A\u064E\u0629\u0657\u06D6 \u064A\u064F\u062D\u064E\u0631\u0651\u0650\u0641\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0644\u0650\u0645\u064E \u0639\u064E\u0646 \u0645\u0651\u064E\u0648\u064E\u0627\u0636\u0650\u0639\u0650\u0647\u0650\u06E6 \u0648\u064E\u0646\u064E\u0633\u064F\u0648\u0627\u0652 \u062D\u064E\u0638\u0651\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0630\u064F\u0643\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0632\u064E\u0627\u0644\u064F \u062A\u064E\u0637\u0651\u064E\u0644\u0650\u0639\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u062E\u064E\u0627\u0653\u0626\u0650\u0646\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0671\u0639\u06E1\u0641\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0635\u06E1\u0641\u064E\u062D\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670\u0653 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0646\u064E\u0633\u064F\u0648\u0627\u0652 \u062D\u064E\u0638\u0651\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0630\u064F\u0643\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u0623\u064E\u063A\u06E1\u0631\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u062F\u064E\u0627\u0648\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u063A\u06E1\u0636\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06DA \u0648\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0635\u06E1\u0646\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0646\u064E\u0627 \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u062E\u06E1\u0641\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u064A\u064E\u0639\u06E1\u0641\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0643\u064E\u062B\u0650\u064A\u0631\u0656\u06DA \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0646\u064F\u0648\u0631\u065E \u0648\u064E\u0643\u0650\u062A\u064E\u0670\u0628\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 16, text: "\u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0628\u0650\u0647\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0633\u064F\u0628\u064F\u0644\u064E \u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0670\u0645\u0650 \u0648\u064E\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064F\u0648\u0631\u0650 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 17, text: "\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0641\u064E\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064F \u0671\u0628\u06E1\u0646\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E\u06DA \u0642\u064F\u0644\u06E1 \u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0623\u064E\u0646 \u064A\u064F\u0647\u06E1\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064E \u0671\u0628\u06E1\u0646\u064E \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0648\u064E\u0623\u064F\u0645\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627\u06D7 \u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u06DA \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 18, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u064A\u064E\u0647\u064F\u0648\u062F\u064F \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670 \u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0628\u06E1\u0646\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u062D\u0650\u0628\u0651\u064E\u0640\u0670\u0653\u0624\u064F\u0647\u064F\u06E5\u06DA \u0642\u064F\u0644\u06E1 \u0641\u064E\u0644\u0650\u0645\u064E \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0643\u064F\u0645 \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06D6 \u0628\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E\u06DA \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 19, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0646\u064E\u0627 \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0641\u064E\u062A\u06E1\u0631\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u0650 \u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0634\u0650\u064A\u0631\u0656 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0630\u0650\u064A\u0631\u0656\u06D6 \u0641\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645 \u0628\u064E\u0634\u0650\u064A\u0631\u065E \u0648\u064E\u0646\u064E\u0630\u0650\u064A\u0631\u065E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 20, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u062C\u064E\u0639\u064E\u0644\u064E \u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u06E2\u0628\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064F\u0644\u064F\u0648\u0643\u0657\u0627 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064F\u0624\u06E1\u062A\u0650 \u0623\u064E\u062D\u064E\u062F\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u062F\u0651\u064E\u0633\u064E\u0629\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064E\u062A\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0631\u06E1\u062A\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062F\u06E1\u0628\u064E\u0627\u0631\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u062A\u064E\u0646\u0642\u064E\u0644\u0650\u0628\u064F\u0648\u0627\u0652 \u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 22, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u062C\u064E\u0628\u0651\u064E\u0627\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646 \u0646\u0651\u064E\u062F\u06E1\u062E\u064F\u0644\u064E\u0647\u064E\u0627 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0641\u064E\u0625\u0650\u0646 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u062F\u064E\u0670\u062E\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u062C\u064F\u0644\u064E\u0627\u0646\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064E\u0627 \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u0627\u0628\u064E \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062F\u064E\u062E\u064E\u0644\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u063A\u064E\u0670\u0644\u0650\u0628\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 24, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646 \u0646\u0651\u064E\u062F\u06E1\u062E\u064F\u0644\u064E\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627 \u0645\u0651\u064E\u0627 \u062F\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u0671\u0630\u06E1\u0647\u064E\u0628\u06E1 \u0623\u064E\u0646\u062A\u064E \u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0641\u064E\u0642\u064E\u0670\u062A\u0650\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0647\u064E\u0670\u0647\u064F\u0646\u064E\u0627 \u0642\u064E\u0670\u0639\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u0641\u06E1\u0633\u0650\u064A \u0648\u064E\u0623\u064E\u062E\u0650\u064A\u06D6 \u0641\u064E\u0671\u0641\u06E1\u0631\u064F\u0642\u06E1 \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0645\u064F\u062D\u064E\u0631\u0651\u064E\u0645\u064E\u0629\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DB \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u0650\u064A\u0646\u064E \u0633\u064E\u0646\u064E\u0629\u0657\u06DB \u064A\u064E\u062A\u0650\u064A\u0647\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 27, text: "\u06DE\u0648\u064E\u0671\u062A\u06E1\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0646\u064E\u0628\u064E\u0623\u064E \u0671\u0628\u06E1\u0646\u064E\u064A\u06E1 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0631\u0651\u064E\u0628\u064E\u0627 \u0642\u064F\u0631\u06E1\u0628\u064E\u0627\u0646\u0657\u0627 \u0641\u064E\u062A\u064F\u0642\u064F\u0628\u0651\u0650\u0644\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u0650\u0647\u0650\u0645\u064E\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u062A\u064E\u0642\u064E\u0628\u0651\u064E\u0644\u06E1 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u064E\u0631\u0650 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0623\u064E\u0642\u06E1\u062A\u064F\u0644\u064E\u0646\u0651\u064E\u0643\u064E\u06D6 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u062A\u064E\u0642\u064E\u0628\u0651\u064E\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u0644\u064E\u0626\u0650\u0646\u06E2 \u0628\u064E\u0633\u064E\u0637\u062A\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u064A\u064E\u062F\u064E\u0643\u064E \u0644\u0650\u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064E\u0646\u0650\u064A \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0628\u0650\u0628\u064E\u0627\u0633\u0650\u0637\u0656 \u064A\u064E\u062F\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0644\u0650\u0623\u064E\u0642\u06E1\u062A\u064F\u0644\u064E\u0643\u064E\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u064E \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 29, text: "\u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u062A\u064E\u0628\u064F\u0648\u0653\u0623\u064E \u0628\u0650\u0625\u0650\u062B\u06E1\u0645\u0650\u064A \u0648\u064E\u0625\u0650\u062B\u06E1\u0645\u0650\u0643\u064E \u0641\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0641\u064E\u0637\u064E\u0648\u0651\u064E\u0639\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0646\u064E\u0641\u06E1\u0633\u064F\u0647\u064F\u06E5 \u0642\u064E\u062A\u06E1\u0644\u064E \u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u0641\u064E\u0642\u064E\u062A\u064E\u0644\u064E\u0647\u064F\u06E5 \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 31, text: "\u0641\u064E\u0628\u064E\u0639\u064E\u062B\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064F\u0631\u064E\u0627\u0628\u0657\u0627 \u064A\u064E\u0628\u06E1\u062D\u064E\u062B\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0644\u0650\u064A\u064F\u0631\u0650\u064A\u064E\u0647\u064F\u06E5 \u0643\u064E\u064A\u06E1\u0641\u064E \u064A\u064F\u0648\u064E\u0670\u0631\u0650\u064A \u0633\u064E\u0648\u06E1\u0621\u064E\u0629\u064E \u0623\u064E\u062E\u0650\u064A\u0647\u0650\u06DA \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0648\u064E\u064A\u06E1\u0644\u064E\u062A\u064E\u0649\u0670\u0653 \u0623\u064E\u0639\u064E\u062C\u064E\u0632\u06E1\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u062B\u06E1\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u063A\u064F\u0631\u064E\u0627\u0628\u0650 \u0641\u064E\u0623\u064F\u0648\u064E\u0670\u0631\u0650\u064A\u064E \u0633\u064E\u0648\u06E1\u0621\u064E\u0629\u064E \u0623\u064E\u062E\u0650\u064A\u06D6 \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0640\u0670\u062F\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0645\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0644\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0643\u064E\u062A\u064E\u0628\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646 \u0642\u064E\u062A\u064E\u0644\u064E \u0646\u064E\u0641\u06E1\u0633\u064E\u06E2\u0627 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0646\u064E\u0641\u06E1\u0633\u064D \u0623\u064E\u0648\u06E1 \u0641\u064E\u0633\u064E\u0627\u062F\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u0642\u064E\u062A\u064E\u0644\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u062D\u06E1\u064A\u064E\u0627\u0647\u064E\u0627 \u0641\u064E\u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062D\u06E1\u064A\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627\u06DA \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0644\u064E\u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062C\u064E\u0632\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062D\u064E\u0627\u0631\u0650\u0628\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u064A\u064E\u0633\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0633\u064E\u0627\u062F\u064B\u0627 \u0623\u064E\u0646 \u064A\u064F\u0642\u064E\u062A\u0651\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1 \u064A\u064F\u0635\u064E\u0644\u0651\u064E\u0628\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1 \u062A\u064F\u0642\u064E\u0637\u0651\u064E\u0639\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u0650\u0644\u064E\u0670\u0641\u064D \u0623\u064E\u0648\u06E1 \u064A\u064F\u0646\u0641\u064E\u0648\u06E1\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062E\u0650\u0632\u06E1\u064A\u065E \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u064C" }, { id: 34, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u062A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 35, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0648\u064E\u0633\u0650\u064A\u0644\u064E\u0629\u064E \u0648\u064E\u062C\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0648\u064E\u0645\u0650\u062B\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0644\u0650\u064A\u064E\u0641\u06E1\u062A\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0645\u064E\u0627 \u062A\u064F\u0642\u064F\u0628\u0651\u0650\u0644\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 37, text: "\u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0628\u0650\u062E\u064E\u0670\u0631\u0650\u062C\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0642\u0650\u064A\u0645\u065E" }, { id: 38, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0627\u0631\u0650\u0642\u064F \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0627\u0631\u0650\u0642\u064E\u0629\u064F \u0641\u064E\u0671\u0642\u06E1\u0637\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u064E\u0627 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064E\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u0627 \u0646\u064E\u0643\u064E\u0670\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 39, text: "\u0641\u064E\u0645\u064E\u0646 \u062A\u064E\u0627\u0628\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0638\u064F\u0644\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062A\u064F\u0648\u0628\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 40, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 41, text: "\u06DE\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0632\u064F\u0646\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0633\u064E\u0670\u0631\u0650\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1\u06DB \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062F\u064F\u0648\u0627\u0652\u06DB \u0633\u064E\u0645\u0651\u064E\u0640\u0670\u0639\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u0650 \u0633\u064E\u0645\u0651\u064E\u0640\u0670\u0639\u064F\u0648\u0646\u064E \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u064D \u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0643\u064E\u06D6 \u064A\u064F\u062D\u064E\u0631\u0651\u0650\u0641\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0644\u0650\u0645\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0648\u064E\u0627\u0636\u0650\u0639\u0650\u0647\u0650\u06E6\u06D6 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0625\u0650\u0646\u06E1 \u0623\u064F\u0648\u062A\u0650\u064A\u062A\u064F\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u064E\u062E\u064F\u0630\u064F\u0648\u0647\u064F \u0648\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064F\u0624\u06E1\u062A\u064E\u0648\u06E1\u0647\u064F \u0641\u064E\u0671\u062D\u06E1\u0630\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0631\u0650\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u062A\u06E1\u0646\u064E\u062A\u064E\u0647\u064F\u06E5 \u0641\u064E\u0644\u064E\u0646 \u062A\u064E\u0645\u06E1\u0644\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0645\u06E1 \u064A\u064F\u0631\u0650\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064F\u0637\u064E\u0647\u0651\u0650\u0631\u064E \u0642\u064F\u0644\u064F\u0648\u0628\u064E\u0647\u064F\u0645\u06E1\u06DA \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062E\u0650\u0632\u06E1\u064A\u065E\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 42, text: "\u0633\u064E\u0645\u0651\u064E\u0640\u0670\u0639\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u0650 \u0623\u064E\u0643\u0651\u064E\u0640\u0670\u0644\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0633\u0651\u064F\u062D\u06E1\u062A\u0650\u06DA \u0641\u064E\u0625\u0650\u0646 \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0643\u064E \u0641\u064E\u0671\u062D\u06E1\u0643\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0646 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0648\u0643\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646\u06E1 \u062D\u064E\u0643\u064E\u0645\u06E1\u062A\u064E \u0641\u064E\u0671\u062D\u06E1\u0643\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0642\u06E1\u0633\u0650\u0637\u0650\u064A\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u064A\u064F\u062D\u064E\u0643\u0651\u0650\u0645\u064F\u0648\u0646\u064E\u0643\u064E \u0648\u064E\u0639\u0650\u0646\u062F\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u064F \u0641\u0650\u064A\u0647\u064E\u0627 \u062D\u064F\u0643\u06E1\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0646\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 44, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0646\u064F\u0648\u0631\u065E\u06DA \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u0650\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0628\u0651\u064E\u0640\u0670\u0646\u0650\u064A\u0651\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0628\u064E\u0627\u0631\u064F \u0628\u0650\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064F\u062D\u06E1\u0641\u0650\u0638\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E\u06DA \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u06E1\u0634\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0648\u064E\u0671\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0634\u06E1\u062A\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u062B\u064E\u0645\u064E\u0646\u0657\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u0643\u064E\u062A\u064E\u0628\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0646\u0651\u064E\u0641\u06E1\u0633\u064E \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0641\u06E1\u0633\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u064A\u06E1\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u0641\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0646\u0641\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064F\u0630\u064F\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u064F\u0630\u064F\u0646\u0650 \u0648\u064E\u0671\u0644\u0633\u0651\u0650\u0646\u0651\u064E \u0628\u0650\u0671\u0644\u0633\u0651\u0650\u0646\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u062C\u064F\u0631\u064F\u0648\u062D\u064E \u0642\u0650\u0635\u064E\u0627\u0635\u065E\u06DA \u0641\u064E\u0645\u064E\u0646 \u062A\u064E\u0635\u064E\u062F\u0651\u064E\u0642\u064E \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u0647\u064F\u0648\u064E \u0643\u064E\u0641\u0651\u064E\u0627\u0631\u064E\u0629\u065E \u0644\u0651\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0642\u064E\u0641\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062B\u064E\u0670\u0631\u0650\u0647\u0650\u0645 \u0628\u0650\u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u0650 \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u0650\u06D6 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u064E \u0641\u0650\u064A\u0647\u0650 \u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0646\u064F\u0648\u0631\u065E \u0648\u064E\u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u0650 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0645\u064E\u0648\u06E1\u0639\u0650\u0638\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0644\u06E1\u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u0650 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0645\u064F\u0647\u064E\u064A\u06E1\u0645\u0650\u0646\u064B\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06D6 \u0641\u064E\u0671\u062D\u06E1\u0643\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0644\u0650\u0643\u064F\u0644\u0651\u0656 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0634\u0650\u0631\u06E1\u0639\u064E\u0629\u0657 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u062C\u0657\u0627\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u0650\u064A\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0628\u0650\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064E\u0670\u062A\u0650\u06DA \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0641\u064E\u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u062A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0623\u064E\u0646\u0650 \u0671\u062D\u06E1\u0643\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u062D\u06E1\u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u0641\u06E1\u062A\u0650\u0646\u064F\u0648\u0643\u064E \u0639\u064E\u0646\u06E2 \u0628\u064E\u0639\u06E1\u0636\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064F\u0635\u0650\u064A\u0628\u064E\u0647\u064F\u0645 \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0650 \u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0623\u064E\u0641\u064E\u062D\u064F\u0643\u06E1\u0645\u064E \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u0650\u064A\u0651\u064E\u0629\u0650 \u064A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064F\u0643\u06E1\u0645\u0657\u0627 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u06DE\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u064A\u064E\u0647\u064F\u0648\u062F\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E\u06D8 \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064F \u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 52, text: "\u0641\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u065E \u064A\u064F\u0633\u064E\u0670\u0631\u0650\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0646\u064E\u062E\u06E1\u0634\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064F\u0635\u0650\u064A\u0628\u064E\u0646\u064E\u0627 \u062F\u064E\u0627\u0653\u0626\u0650\u0631\u064E\u0629\u065E\u06DA \u0641\u064E\u0639\u064E\u0633\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0628\u0650\u0671\u0644\u06E1\u0641\u064E\u062A\u06E1\u062D\u0650 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0647\u0650\u06E6 \u0641\u064E\u064A\u064F\u0635\u06E1\u0628\u0650\u062D\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0646\u064E\u0670\u062F\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 53, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0642\u06E1\u0633\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0647\u06E1\u062F\u064E \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1\u06DA \u062D\u064E\u0628\u0650\u0637\u064E\u062A\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0646 \u064A\u064E\u0631\u06E1\u062A\u064E\u062F\u0651\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646 \u062F\u0650\u064A\u0646\u0650\u0647\u0650\u06E6 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0623\u06E1\u062A\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u062D\u0650\u0628\u0651\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0630\u0650\u0644\u0651\u064E\u0629\u064D \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0623\u064E\u0639\u0650\u0632\u0651\u064E\u0629\u064D \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u064A\u064F\u062C\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0644\u064E\u0648\u06E1\u0645\u064E\u0629\u064E \u0644\u064E\u0627\u0653\u0626\u0650\u0645\u0656\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u0647\u0650 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0670\u0633\u0650\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 55, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0648\u064E\u0644\u0650\u064A\u0651\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0642\u0650\u064A\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u064A\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u0670\u0643\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u062D\u0650\u0632\u06E1\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u062F\u0650\u064A\u0646\u064E\u0643\u064F\u0645\u06E1 \u0647\u064F\u0632\u064F\u0648\u0657\u0627 \u0648\u064E\u0644\u064E\u0639\u0650\u0628\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064E \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0646\u064E\u0627\u062F\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0647\u064E\u0627 \u0647\u064F\u0632\u064F\u0648\u0657\u0627 \u0648\u064E\u0644\u064E\u0639\u0650\u0628\u0657\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0647\u064E\u0644\u06E1 \u062A\u064E\u0646\u0642\u0650\u0645\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0642\u064F\u0644\u06E1 \u0647\u064E\u0644\u06E1 \u0623\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0634\u064E\u0631\u0651\u0656 \u0645\u0651\u0650\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u062B\u064F\u0648\u0628\u064E\u0629\u064B \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0645\u064E\u0646 \u0644\u0651\u064E\u0639\u064E\u0646\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u063A\u064E\u0636\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0642\u0650\u0631\u064E\u062F\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u062E\u064E\u0646\u064E\u0627\u0632\u0650\u064A\u0631\u064E \u0648\u064E\u0639\u064E\u0628\u064E\u062F\u064E \u0671\u0644\u0637\u0651\u064E\u0640\u0670\u063A\u064F\u0648\u062A\u064E\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0634\u064E\u0631\u0651\u065E \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u0657\u0627 \u0648\u064E\u0623\u064E\u0636\u064E\u0644\u0651\u064F \u0639\u064E\u0646 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650" }, { id: 61, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0643\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0648\u064E\u0642\u064E\u062F \u062F\u0651\u064E\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u062F\u06E1 \u062E\u064E\u0631\u064E\u062C\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0649\u0670 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064F\u0633\u064E\u0670\u0631\u0650\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064F\u062F\u06E1\u0648\u064E\u0670\u0646\u0650 \u0648\u064E\u0623\u064E\u0643\u06E1\u0644\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0633\u0651\u064F\u062D\u06E1\u062A\u064E\u06DA \u0644\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u064A\u064E\u0646\u06E1\u0647\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0628\u0651\u064E\u0640\u0670\u0646\u0650\u064A\u0651\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0628\u064E\u0627\u0631\u064F \u0639\u064E\u0646 \u0642\u064E\u0648\u06E1\u0644\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u064E \u0648\u064E\u0623\u064E\u0643\u06E1\u0644\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0633\u0651\u064F\u062D\u06E1\u062A\u064E\u06DA \u0644\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0635\u06E1\u0646\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u064A\u064E\u0647\u064F\u0648\u062F\u064F \u064A\u064E\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u063A\u06E1\u0644\u064F\u0648\u0644\u064E\u0629\u064C\u06DA \u063A\u064F\u0644\u0651\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064F\u0639\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652\u06D8 \u0628\u064E\u0644\u06E1 \u064A\u064E\u062F\u064E\u0627\u0647\u064F \u0645\u064E\u0628\u06E1\u0633\u064F\u0648\u0637\u064E\u062A\u064E\u0627\u0646\u0650 \u064A\u064F\u0646\u0641\u0650\u0642\u064F \u0643\u064E\u064A\u06E1\u0641\u064E \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0644\u064E\u064A\u064E\u0632\u0650\u064A\u062F\u064E\u0646\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0637\u064F\u063A\u06E1\u064A\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0643\u064F\u0641\u06E1\u0631\u0657\u0627\u06DA \u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u062F\u064E\u0670\u0648\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u063A\u06E1\u0636\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06DA \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u0642\u064E\u062F\u064F\u0648\u0627\u0652 \u0646\u064E\u0627\u0631\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u062D\u064E\u0631\u06E1\u0628\u0650 \u0623\u064E\u0637\u06E1\u0641\u064E\u0623\u064E\u0647\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u064A\u064E\u0633\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0633\u064E\u0627\u062F\u0657\u0627\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 65, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0644\u064E\u0643\u064E\u0641\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0623\u064E\u062F\u06E1\u062E\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u0639\u0650\u064A\u0645\u0650" }, { id: 66, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0623\u064E\u0643\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650 \u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u0650\u0647\u0650\u0645\u06DA \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u065E \u0645\u0651\u064F\u0642\u06E1\u062A\u064E\u0635\u0650\u062F\u064E\u0629\u065E\u06D6 \u0648\u064E\u0643\u064E\u062B\u0650\u064A\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u06DE\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0628\u064E\u0644\u0651\u0650\u063A\u06E1 \u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u06E1 \u0641\u064E\u0645\u064E\u0627 \u0628\u064E\u0644\u0651\u064E\u063A\u06E1\u062A\u064E \u0631\u0650\u0633\u064E\u0627\u0644\u064E\u062A\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0635\u0650\u0645\u064F\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 68, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0633\u06E1\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u06E1\u0621\u064D \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064F\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0644\u064E\u064A\u064E\u0632\u0650\u064A\u062F\u064E\u0646\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0637\u064F\u063A\u06E1\u064A\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0643\u064F\u0641\u06E1\u0631\u0657\u0627\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 69, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0640\u0654\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670 \u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0648\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u0657\u0627\u06D6 \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0647\u06E1\u0648\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0648\u064E\u062D\u064E\u0633\u0650\u0628\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u065E \u0641\u064E\u0639\u064E\u0645\u064F\u0648\u0627\u0652 \u0648\u064E\u0635\u064E\u0645\u0651\u064F\u0648\u0627\u0652 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0627\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0639\u064E\u0645\u064F\u0648\u0627\u0652 \u0648\u064E\u0635\u064E\u0645\u0651\u064F\u0648\u0627\u0652 \u0643\u064E\u062B\u0650\u064A\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u0635\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0641\u064E\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064F \u0671\u0628\u06E1\u0646\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064F \u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u06E1 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0642\u064E\u062F\u06E1 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0644\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u0635\u064E\u0627\u0631\u0656" }, { id: 73, text: "\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0641\u064E\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062B\u064E\u0627\u0644\u0650\u062B\u064F \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u0656\u06D8 \u0648\u064E\u0645\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E\u06DA \u0648\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0646\u062A\u064E\u0647\u064F\u0648\u0627\u0652 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u064E\u064A\u064E\u0645\u064E\u0633\u0651\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 74, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u062A\u064F\u0648\u0628\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0646\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 75, text: "\u0645\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064F \u0671\u0628\u06E1\u0646\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650 \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064F \u0648\u064E\u0623\u064F\u0645\u0651\u064F\u0647\u064F\u06E5 \u0635\u0650\u062F\u0651\u0650\u064A\u0642\u064E\u0629\u065E\u06D6 \u0643\u064E\u0627\u0646\u064E\u0627 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064E\u0627\u0646\u0650 \u0671\u0644\u0637\u0651\u064E\u0639\u064E\u0627\u0645\u064E\u06D7 \u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0646\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u062B\u064F\u0645\u0651\u064E \u0671\u0646\u0638\u064F\u0631\u06E1 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0636\u064E\u0631\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0641\u06E1\u0639\u0657\u0627\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 77, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0627 \u062A\u064E\u063A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062F\u0650\u064A\u0646\u0650\u0643\u064F\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E \u0642\u064E\u0648\u06E1\u0645\u0656 \u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0623\u064E\u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650" }, { id: 78, text: "\u0644\u064F\u0639\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0644\u0650\u0633\u064E\u0627\u0646\u0650 \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0648\u064E\u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u0650 \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0635\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 79, text: "\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u062A\u064E\u0646\u064E\u0627\u0647\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646 \u0645\u0651\u064F\u0646\u0643\u064E\u0631\u0656 \u0641\u064E\u0639\u064E\u0644\u064F\u0648\u0647\u064F\u06DA \u0644\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 80, text: "\u062A\u064E\u0631\u064E\u0649\u0670 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0644\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u0633\u064E\u062E\u0650\u0637\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0647\u064F\u0645\u06E1 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0627 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 82, text: "\u06DE\u0644\u064E\u062A\u064E\u062C\u0650\u062F\u064E\u0646\u0651\u064E \u0623\u064E\u0634\u064E\u062F\u0651\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0639\u064E\u062F\u064E\u0670\u0648\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u064A\u064E\u0647\u064F\u0648\u062F\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0644\u064E\u062A\u064E\u062C\u0650\u062F\u064E\u0646\u0651\u064E \u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0648\u064E\u062F\u0651\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0642\u0650\u0633\u0651\u0650\u064A\u0633\u0650\u064A\u0646\u064E \u0648\u064E\u0631\u064F\u0647\u06E1\u0628\u064E\u0627\u0646\u0657\u0627 \u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u062A\u064E\u0631\u064E\u0649\u0670\u0653 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u064E\u0647\u064F\u0645\u06E1 \u062A\u064E\u0641\u0650\u064A\u0636\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u062F\u0651\u064E\u0645\u06E1\u0639\u0650 \u0645\u0650\u0645\u0651\u064E\u0627 \u0639\u064E\u0631\u064E\u0641\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0641\u064E\u0671\u0643\u06E1\u062A\u064F\u0628\u06E1\u0646\u064E\u0627 \u0645\u064E\u0639\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 84, text: "\u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0646\u064E\u0627 \u0644\u064E\u0627 \u0646\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0646\u064E\u0637\u06E1\u0645\u064E\u0639\u064F \u0623\u064E\u0646 \u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 85, text: "\u0641\u064E\u0623\u064E\u062B\u064E\u0670\u0628\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 86, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 87, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064F\u062D\u064E\u0631\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u062D\u064E\u0644\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062A\u064E\u062F\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0639\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 88, text: "\u0648\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062D\u064E\u0644\u064E\u0670\u0644\u0657\u0627 \u0637\u064E\u064A\u0651\u0650\u0628\u0657\u0627\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 89, text: "\u0644\u064E\u0627 \u064A\u064F\u0624\u064E\u0627\u062E\u0650\u0630\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u063A\u06E1\u0648\u0650 \u0641\u0650\u064A\u0653 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u064A\u064F\u0624\u064E\u0627\u062E\u0650\u0630\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0642\u0651\u064E\u062F\u062A\u0651\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u06D6 \u0641\u064E\u0643\u064E\u0641\u0651\u064E\u0640\u0670\u0631\u064E\u062A\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0637\u06E1\u0639\u064E\u0627\u0645\u064F \u0639\u064E\u0634\u064E\u0631\u064E\u0629\u0650 \u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0648\u06E1\u0633\u064E\u0637\u0650 \u0645\u064E\u0627 \u062A\u064F\u0637\u06E1\u0639\u0650\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0647\u06E1\u0644\u0650\u064A\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0643\u0650\u0633\u06E1\u0648\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u062A\u064E\u062D\u06E1\u0631\u0650\u064A\u0631\u064F \u0631\u064E\u0642\u064E\u0628\u064E\u0629\u0656\u06D6 \u0641\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062C\u0650\u062F\u06E1 \u0641\u064E\u0635\u0650\u064A\u064E\u0627\u0645\u064F \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0643\u064E\u0641\u0651\u064E\u0640\u0670\u0631\u064E\u0629\u064F \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u062D\u064E\u0644\u064E\u0641\u06E1\u062A\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u062D\u06E1\u0641\u064E\u0638\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u0643\u064F\u0645\u06E1\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 90, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u062E\u064E\u0645\u06E1\u0631\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u0633\u0650\u0631\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u0635\u064E\u0627\u0628\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0632\u06E1\u0644\u064E\u0670\u0645\u064F \u0631\u0650\u062C\u06E1\u0633\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0645\u064E\u0644\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0641\u064E\u0671\u062C\u06E1\u062A\u064E\u0646\u0650\u0628\u064F\u0648\u0647\u064F \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 91, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0623\u064E\u0646 \u064A\u064F\u0648\u0642\u0650\u0639\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u062F\u064E\u0670\u0648\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u063A\u06E1\u0636\u064E\u0627\u0653\u0621\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u064E\u0645\u06E1\u0631\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u0633\u0650\u0631\u0650 \u0648\u064E\u064A\u064E\u0635\u064F\u062F\u0651\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0639\u064E\u0646\u0650 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650\u06D6 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0646\u062A\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 92, text: "\u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0648\u064E\u0671\u062D\u06E1\u0630\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 93, text: "\u0644\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u062C\u064F\u0646\u064E\u0627\u062D\u065E \u0641\u0650\u064A\u0645\u064E\u0627 \u0637\u064E\u0639\u0650\u0645\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627 \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u062B\u064F\u0645\u0651\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u062B\u064F\u0645\u0651\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 94, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u064A\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u062F\u0650 \u062A\u064E\u0646\u064E\u0627\u0644\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u0650\u0645\u064E\u0627\u062D\u064F\u0643\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0646 \u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650\u06DA \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0639\u06E1\u062A\u064E\u062F\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 95, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u062F\u064E \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062D\u064F\u0631\u064F\u0645\u065E\u06DA \u0648\u064E\u0645\u064E\u0646 \u0642\u064E\u062A\u064E\u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064F\u062A\u064E\u0639\u064E\u0645\u0651\u0650\u062F\u0657\u0627 \u0641\u064E\u062C\u064E\u0632\u064E\u0627\u0653\u0621\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F \u0645\u064E\u0627 \u0642\u064E\u062A\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0639\u064E\u0645\u0650 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u0650\u0647\u0650\u06E6 \u0630\u064E\u0648\u064E\u0627 \u0639\u064E\u062F\u06E1\u0644\u0656 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0647\u064E\u062F\u06E1\u064A\u064E\u06E2\u0627 \u0628\u064E\u0670\u0644\u0650\u063A\u064E \u0671\u0644\u06E1\u0643\u064E\u0639\u06E1\u0628\u064E\u0629\u0650 \u0623\u064E\u0648\u06E1 \u0643\u064E\u0641\u0651\u064E\u0640\u0670\u0631\u064E\u0629\u065E \u0637\u064E\u0639\u064E\u0627\u0645\u064F \u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u064E \u0623\u064E\u0648\u06E1 \u0639\u064E\u062F\u06E1\u0644\u064F \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0635\u0650\u064A\u064E\u0627\u0645\u0657\u0627 \u0644\u0651\u0650\u064A\u064E\u0630\u064F\u0648\u0642\u064E \u0648\u064E\u0628\u064E\u0627\u0644\u064E \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6\u06D7 \u0639\u064E\u0641\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0645\u0651\u064E\u0627 \u0633\u064E\u0644\u064E\u0641\u064E\u06DA \u0648\u064E\u0645\u064E\u0646\u06E1 \u0639\u064E\u0627\u062F\u064E \u0641\u064E\u064A\u064E\u0646\u062A\u064E\u0642\u0650\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u065E \u0630\u064F\u0648 \u0671\u0646\u062A\u0650\u0642\u064E\u0627\u0645\u064D" }, { id: 96, text: "\u0623\u064F\u062D\u0650\u0644\u0651\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0635\u064E\u064A\u06E1\u062F\u064F \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0648\u064E\u0637\u064E\u0639\u064E\u0627\u0645\u064F\u0647\u064F\u06E5 \u0645\u064E\u062A\u064E\u0670\u0639\u0657\u0627 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u0644\u0633\u0651\u064E\u064A\u0651\u064E\u0627\u0631\u064E\u0629\u0650\u06D6 \u0648\u064E\u062D\u064F\u0631\u0651\u0650\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0635\u064E\u064A\u06E1\u062F\u064F \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0645\u064E\u0627 \u062F\u064F\u0645\u06E1\u062A\u064F\u0645\u06E1 \u062D\u064F\u0631\u064F\u0645\u0657\u0627\u06D7 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u06DE\u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0643\u064E\u0639\u06E1\u0628\u064E\u0629\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u064E \u0642\u0650\u064A\u064E\u0670\u0645\u0657\u0627 \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u06E1\u0631\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u064E \u0648\u064E\u0671\u0644\u06E1\u0647\u064E\u062F\u06E1\u064A\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u062F\u064E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 98, text: "\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 99, text: "\u0645\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064F\u0628\u06E1\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 100, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u064F \u0648\u064E\u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064F \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0639\u06E1\u062C\u064E\u0628\u064E\u0643\u064E \u0643\u064E\u062B\u06E1\u0631\u064E\u0629\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u0650\u06DA \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0640\u0670\u0653\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 101, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1 \u0623\u064E\u0634\u06E1\u064A\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u0646 \u062A\u064F\u0628\u06E1\u062F\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0633\u064F\u0624\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u062D\u0650\u064A\u0646\u064E \u064A\u064F\u0646\u064E\u0632\u0651\u064E\u0644\u064F \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064F \u062A\u064F\u0628\u06E1\u062F\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0641\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u06E1\u0647\u064E\u0627\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u064C \u062D\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 102, text: "\u0642\u064E\u062F\u06E1 \u0633\u064E\u0623\u064E\u0644\u064E\u0647\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u065E \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627 \u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 103, text: "\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u062D\u0650\u064A\u0631\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u0627 \u0633\u064E\u0627\u0653\u0626\u0650\u0628\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u0627 \u0648\u064E\u0635\u0650\u064A\u0644\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u0627 \u062D\u064E\u0627\u0645\u0656 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E\u06D6 \u0648\u064E\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 104, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062A\u064E\u0639\u064E\u0627\u0644\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062D\u064E\u0633\u06E1\u0628\u064F\u0646\u064E\u0627 \u0645\u064E\u0627 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627\u0653\u06DA \u0623\u064E\u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 105, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0644\u064E\u0627 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u0636\u064E\u0644\u0651\u064E \u0625\u0650\u0630\u064E\u0627 \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1\u06DA \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0641\u064E\u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 106, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0634\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u064F \u0628\u064E\u064A\u06E1\u0646\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u062D\u064E\u0636\u064E\u0631\u064E \u0623\u064E\u062D\u064E\u062F\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u062D\u0650\u064A\u0646\u064E \u0671\u0644\u06E1\u0648\u064E\u0635\u0650\u064A\u0651\u064E\u0629\u0650 \u0671\u062B\u06E1\u0646\u064E\u0627\u0646\u0650 \u0630\u064E\u0648\u064E\u0627 \u0639\u064E\u062F\u06E1\u0644\u0656 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0621\u064E\u0627\u062E\u064E\u0631\u064E\u0627\u0646\u0650 \u0645\u0650\u0646\u06E1 \u063A\u064E\u064A\u06E1\u0631\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0636\u064E\u0631\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0623\u064E\u0635\u064E\u0670\u0628\u064E\u062A\u06E1\u0643\u064F\u0645 \u0645\u0651\u064F\u0635\u0650\u064A\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650\u06DA \u062A\u064E\u062D\u06E1\u0628\u0650\u0633\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0641\u064E\u064A\u064F\u0642\u06E1\u0633\u0650\u0645\u064E\u0627\u0646\u0650 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646\u0650 \u0671\u0631\u06E1\u062A\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u0646\u064E\u0634\u06E1\u062A\u064E\u0631\u0650\u064A \u0628\u0650\u0647\u0650\u06E6 \u062B\u064E\u0645\u064E\u0646\u0657\u0627 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0627 \u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0643\u06E1\u062A\u064F\u0645\u064F \u0634\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u062B\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 107, text: "\u0641\u064E\u0625\u0650\u0646\u06E1 \u0639\u064F\u062B\u0650\u0631\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u062D\u064E\u0642\u0651\u064E\u0627\u0653 \u0625\u0650\u062B\u06E1\u0645\u0657\u0627 \u0641\u064E\u0640\u0654\u064E\u0627\u062E\u064E\u0631\u064E\u0627\u0646\u0650 \u064A\u064E\u0642\u064F\u0648\u0645\u064E\u0627\u0646\u0650 \u0645\u064E\u0642\u064E\u0627\u0645\u064E\u0647\u064F\u0645\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u062D\u064E\u0642\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u06E1\u0644\u064E\u064A\u064E\u0670\u0646\u0650 \u0641\u064E\u064A\u064F\u0642\u06E1\u0633\u0650\u0645\u064E\u0627\u0646\u0650 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0634\u064E\u0647\u064E\u0670\u062F\u064E\u062A\u064F\u0646\u064E\u0627\u0653 \u0623\u064E\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0634\u064E\u0647\u064E\u0670\u062F\u064E\u062A\u0650\u0647\u0650\u0645\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0671\u0639\u06E1\u062A\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 108, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650 \u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u062C\u06E1\u0647\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u062A\u064F\u0631\u064E\u062F\u0651\u064E \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u06E2 \u0628\u064E\u0639\u06E1\u062F\u064E \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 109, text: "\u06DE\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u062C\u06E1\u0645\u064E\u0639\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064E \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0645\u064E\u0627\u0630\u064E\u0627\u0653 \u0623\u064F\u062C\u0650\u0628\u06E1\u062A\u064F\u0645\u06E1\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u0639\u0650\u0644\u06E1\u0645\u064E \u0644\u064E\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0639\u064E\u0644\u0651\u064E\u0640\u0670\u0645\u064F \u0671\u0644\u06E1\u063A\u064F\u064A\u064F\u0648\u0628\u0650" }, { id: 110, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0670\u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064E \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u0650\u064A \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0670\u0644\u0650\u062F\u064E\u062A\u0650\u0643\u064E \u0625\u0650\u0630\u06E1 \u0623\u064E\u064A\u0651\u064E\u062F\u062A\u0651\u064F\u0643\u064E \u0628\u0650\u0631\u064F\u0648\u062D\u0650 \u0671\u0644\u06E1\u0642\u064F\u062F\u064F\u0633\u0650 \u062A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u0647\u06E1\u062F\u0650 \u0648\u064E\u0643\u064E\u0647\u06E1\u0644\u0657\u0627\u06D6 \u0648\u064E\u0625\u0650\u0630\u06E1 \u0639\u064E\u0644\u0651\u064E\u0645\u06E1\u062A\u064F\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u064E\u06D6 \u0648\u064E\u0625\u0650\u0630\u06E1 \u062A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u0650\u064A\u0646\u0650 \u0643\u064E\u0647\u064E\u064A\u06E1\u0640\u0654\u064E\u0629\u0650 \u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u0650 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u064A \u0641\u064E\u062A\u064E\u0646\u0641\u064F\u062E\u064F \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0637\u064E\u064A\u06E1\u0631\u064E\u06E2\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u064A\u06D6 \u0648\u064E\u062A\u064F\u0628\u06E1\u0631\u0650\u0626\u064F \u0671\u0644\u06E1\u0623\u064E\u0643\u06E1\u0645\u064E\u0647\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0631\u064E\u0635\u064E \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u064A\u06D6 \u0648\u064E\u0625\u0650\u0630\u06E1 \u062A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u064A\u06D6 \u0648\u064E\u0625\u0650\u0630\u06E1 \u0643\u064E\u0641\u064E\u0641\u06E1\u062A\u064F \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0639\u064E\u0646\u0643\u064E \u0625\u0650\u0630\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 111, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u062A\u064F \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062D\u064E\u0648\u064E\u0627\u0631\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0623\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u064A \u0648\u064E\u0628\u0650\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u064A \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0648\u064E\u0671\u0634\u06E1\u0647\u064E\u062F\u06E1 \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0646\u064E\u0627 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 112, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u062D\u064E\u0648\u064E\u0627\u0631\u0650\u064A\u0651\u064F\u0648\u0646\u064E \u064A\u064E\u0670\u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064E \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0647\u064E\u0644\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0623\u064E\u0646 \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627\u0653\u0626\u0650\u062F\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650\u06D6 \u0642\u064E\u0627\u0644\u064E \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 113, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0646\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u0646\u0651\u064E\u0623\u06E1\u0643\u064F\u0644\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u062A\u064E\u0637\u06E1\u0645\u064E\u0626\u0650\u0646\u0651\u064E \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0646\u064E\u0627 \u0648\u064E\u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0623\u064E\u0646 \u0642\u064E\u062F\u06E1 \u0635\u064E\u062F\u064E\u0642\u06E1\u062A\u064E\u0646\u064E\u0627 \u0648\u064E\u0646\u064E\u0643\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 114, text: "\u0642\u064E\u0627\u0644\u064E \u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u0645\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u0650\u0644\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627\u0653\u0626\u0650\u062F\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u064E\u0646\u064E\u0627 \u0639\u0650\u064A\u062F\u0657\u0627 \u0644\u0651\u0650\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u0646\u064E\u0627 \u0648\u064E\u0621\u064E\u0627\u062E\u0650\u0631\u0650\u0646\u064E\u0627 \u0648\u064E\u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u0643\u064E\u06D6 \u0648\u064E\u0671\u0631\u06E1\u0632\u064F\u0642\u06E1\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0632\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 115, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u06E1 \u0628\u064E\u0639\u06E1\u062F\u064F \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0647\u064F\u06E5 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0644\u0651\u064E\u0627\u0653 \u0623\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u062D\u064E\u062F\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 116, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0670\u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064E \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0621\u064E\u0623\u064E\u0646\u062A\u064E \u0642\u064F\u0644\u06E1\u062A\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0671\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0646\u0650\u064A \u0648\u064E\u0623\u064F\u0645\u0651\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u0670\u0647\u064E\u064A\u06E1\u0646\u0650 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0642\u064E\u0627\u0644\u064E \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0643\u064E \u0645\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0642\u064F\u0648\u0644\u064E \u0645\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u0650\u064A \u0628\u0650\u062D\u064E\u0642\u0651\u064D\u06DA \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F \u0642\u064F\u0644\u06E1\u062A\u064F\u0647\u064F\u06E5 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064E\u0647\u064F\u06E5\u06DA \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u0650\u064A \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u0650\u0643\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0639\u064E\u0644\u0651\u064E\u0640\u0670\u0645\u064F \u0671\u0644\u06E1\u063A\u064F\u064A\u064F\u0648\u0628\u0650" }, { id: 117, text: "\u0645\u064E\u0627 \u0642\u064F\u0644\u06E1\u062A\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u064E\u0631\u06E1\u062A\u064E\u0646\u0650\u064A \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064F\u0646\u062A\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0634\u064E\u0647\u0650\u064A\u062F\u0657\u0627 \u0645\u0651\u064E\u0627 \u062F\u064F\u0645\u06E1\u062A\u064F \u0641\u0650\u064A\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0648\u064E\u0641\u0651\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0643\u064F\u0646\u062A\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u0631\u0651\u064E\u0642\u0650\u064A\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u064C" }, { id: 118, text: "\u0625\u0650\u0646 \u062A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u064F\u0643\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 119, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0647\u064E\u0670\u0630\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064F \u064A\u064E\u0646\u0641\u064E\u0639\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E \u0635\u0650\u062F\u06E1\u0642\u064F\u0647\u064F\u0645\u06E1\u06DA \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u065E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06D6 \u0631\u0651\u064E\u0636\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 120, text: "\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A\u0647\u0650\u0646\u0651\u064E\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064F\u06E2" }] }, { id: 6, name: "\u0627\u0644\u0623\u0646\u0639\u0627\u0645", transliteration: "Al-An'am", type: "meccan", total_verses: 165, verses: [{ id: 1, text: "\u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064F\u0648\u0631\u064E\u06D6 \u062B\u064F\u0645\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 2, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0637\u0650\u064A\u0646\u0656 \u062B\u064F\u0645\u0651\u064E \u0642\u064E\u0636\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0657\u0627\u06D6 \u0648\u064E\u0623\u064E\u062C\u064E\u0644\u065E \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u064B\u0649 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5\u06D6 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0645\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0633\u0650\u0631\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u062C\u064E\u0647\u06E1\u0631\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0645\u064F\u0639\u06E1\u0631\u0650\u0636\u0650\u064A\u0646\u064E" }, { id: 5, text: "\u0641\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0643\u064E\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u0646\u0656 \u0645\u0651\u064E\u0643\u0651\u064E\u0646\u0651\u064E\u0640\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u0646\u064F\u0645\u064E\u0643\u0651\u0650\u0646 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u062F\u06E1\u0631\u064E\u0627\u0631\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0634\u064E\u0623\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0631\u06E1\u0646\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627 \u0641\u0650\u064A \u0642\u0650\u0631\u06E1\u0637\u064E\u0627\u0633\u0656 \u0641\u064E\u0644\u064E\u0645\u064E\u0633\u064F\u0648\u0647\u064F \u0628\u0650\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0644\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 8, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0644\u064E\u0643\u065E\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u0657\u0627 \u0644\u0651\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064F\u0646\u0638\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u064E\u0644\u064E\u0643\u0657\u0627 \u0644\u0651\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0631\u064E\u062C\u064F\u0644\u0657\u0627 \u0648\u064E\u0644\u064E\u0644\u064E\u0628\u064E\u0633\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u0644\u06E1\u0628\u0650\u0633\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u0650 \u0671\u0633\u06E1\u062A\u064F\u0647\u06E1\u0632\u0650\u0626\u064E \u0628\u0650\u0631\u064F\u0633\u064F\u0644\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0641\u064E\u062D\u064E\u0627\u0642\u064E \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0633\u064E\u062E\u0650\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0642\u064F\u0644\u06E1 \u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062B\u064F\u0645\u0651\u064E \u0671\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 12, text: "\u0642\u064F\u0644 \u0644\u0651\u0650\u0645\u064E\u0646 \u0645\u0651\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0643\u064E\u062A\u064E\u0628\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u064E\u06DA \u0644\u064E\u064A\u064E\u062C\u06E1\u0645\u064E\u0639\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0644\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u0650\u06DA \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0633\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u06DE\u0648\u064E\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0633\u064E\u0643\u064E\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 14, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0641\u064E\u0627\u0637\u0650\u0631\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064F\u0637\u06E1\u0639\u0650\u0645\u064F \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0637\u06E1\u0639\u064E\u0645\u064F\u06D7 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0643\u064F\u0648\u0646\u064E \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u064E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 15, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0625\u0650\u0646\u06E1 \u0639\u064E\u0635\u064E\u064A\u06E1\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 16, text: "\u0645\u0651\u064E\u0646 \u064A\u064F\u0635\u06E1\u0631\u064E\u0641\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0631\u064E\u062D\u0650\u0645\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 17, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0645\u06E1\u0633\u064E\u0633\u06E1\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0636\u064F\u0631\u0651\u0656 \u0641\u064E\u0644\u064E\u0627 \u0643\u064E\u0627\u0634\u0650\u0641\u064E \u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0645\u06E1\u0633\u064E\u0633\u06E1\u0643\u064E \u0628\u0650\u062E\u064E\u064A\u06E1\u0631\u0656 \u0641\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 18, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0642\u064E\u0627\u0647\u0650\u0631\u064F \u0641\u064E\u0648\u06E1\u0642\u064E \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 19, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u064A\u0651\u064F \u0634\u064E\u064A\u06E1\u0621\u064D \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u0634\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0657\u06D6 \u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0634\u064E\u0647\u0650\u064A\u062F\u064F\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064F \u0644\u0650\u0623\u064F\u0646\u0630\u0650\u0631\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0645\u064E\u0646\u06E2 \u0628\u064E\u0644\u064E\u063A\u064E\u06DA \u0623\u064E\u0626\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u062A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u064B \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u06DA \u0642\u064F\u0644 \u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u06DA \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0646\u0650\u064A \u0628\u064E\u0631\u0650\u064A\u0653\u0621\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u064A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0643\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F\u06D8 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0633\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u062D\u06E1\u0634\u064F\u0631\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0646\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u0646\u064E \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0632\u06E1\u0639\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0646 \u0641\u0650\u062A\u06E1\u0646\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 24, text: "\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0630\u064E\u0628\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0643\u0650\u0646\u0651\u064E\u0629\u064B \u0623\u064E\u0646 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0647\u064F \u0648\u064E\u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0642\u06E1\u0631\u0657\u0627\u06DA \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0643\u064F\u0644\u0651\u064E \u0621\u064E\u0627\u064A\u064E\u0629\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0643\u064E \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u064E\u0670\u0637\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u06E1\u0647\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646\u06E1\u0647\u064F \u0648\u064E\u064A\u064E\u0646\u06E1\u0640\u0654\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064F\u0647\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u062A\u064E\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u06E1 \u0648\u064F\u0642\u0650\u0641\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E\u0646\u064E\u0627 \u0646\u064F\u0631\u064E\u062F\u0651\u064F \u0648\u064E\u0644\u064E\u0627 \u0646\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0648\u064E\u0646\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u0628\u064E\u0644\u06E1 \u0628\u064E\u062F\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u062E\u06E1\u0641\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0631\u064F\u062F\u0651\u064F\u0648\u0627\u0652 \u0644\u064E\u0639\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0644\u0650\u0645\u064E\u0627 \u0646\u064F\u0647\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u06E1 \u0647\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u062D\u064E\u064A\u064E\u0627\u062A\u064F\u0646\u064E\u0627 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u0645\u064E\u0628\u06E1\u0639\u064F\u0648\u062B\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u062A\u064E\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u06E1 \u0648\u064F\u0642\u0650\u0641\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06DA \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0642\u064E\u062F\u06E1 \u062E\u064E\u0633\u0650\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0644\u0650\u0642\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u062D\u064E\u0633\u06E1\u0631\u064E\u062A\u064E\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0641\u064E\u0631\u0651\u064E\u0637\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u0648\u06E1\u0632\u064E\u0627\u0631\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0638\u064F\u0647\u064F\u0648\u0631\u0650\u0647\u0650\u0645\u06E1\u06DA \u0623\u064E\u0644\u064E\u0627 \u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u064A\u064E\u0632\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u064E\u0639\u0650\u0628\u065E \u0648\u064E\u0644\u064E\u0647\u06E1\u0648\u065E\u06D6 \u0648\u064E\u0644\u064E\u0644\u062F\u0651\u064E\u0627\u0631\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064F \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0642\u064E\u062F\u06E1 \u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u064A\u064E\u062D\u06E1\u0632\u064F\u0646\u064F\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E\u06D6 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E\u0643\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u062C\u06E1\u062D\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064F\u0630\u0651\u0650\u0628\u064E\u062A\u06E1 \u0631\u064F\u0633\u064F\u0644\u065E \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0641\u064E\u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0643\u064F\u0630\u0651\u0650\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064F\u0648\u0630\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0646\u064E\u0635\u06E1\u0631\u064F\u0646\u064E\u0627\u06DA \u0648\u064E\u0644\u064E\u0627 \u0645\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064E \u0644\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0645\u0650\u0646 \u0646\u0651\u064E\u0628\u064E\u0625\u0650\u064A\u0652 \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 35, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0643\u064E\u0628\u064F\u0631\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0625\u0650\u0639\u06E1\u0631\u064E\u0627\u0636\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0639\u06E1\u062A\u064E \u0623\u064E\u0646 \u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u0650\u064A\u064E \u0646\u064E\u0641\u064E\u0642\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0648\u06E1 \u0633\u064F\u0644\u0651\u064E\u0645\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0641\u064E\u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u0656\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u062C\u064E\u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670\u06DA \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 36, text: "\u06DE\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E\u06D8 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0646\u064F\u0632\u0651\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u064A\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06DA \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u0627\u062F\u0650\u0631\u064C \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064E \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0648\u064E\u0645\u064E\u0627 \u0645\u0650\u0646 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u0637\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u0656 \u064A\u064E\u0637\u0650\u064A\u0631\u064F \u0628\u0650\u062C\u064E\u0646\u064E\u0627\u062D\u064E\u064A\u06E1\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064F\u0645\u064E\u0645\u064C \u0623\u064E\u0645\u06E1\u062B\u064E\u0627\u0644\u064F\u0643\u064F\u0645\u06DA \u0645\u0651\u064E\u0627 \u0641\u064E\u0631\u0651\u064E\u0637\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0635\u064F\u0645\u0651\u065E \u0648\u064E\u0628\u064F\u0643\u06E1\u0645\u065E \u0641\u0650\u064A \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650\u06D7 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0625\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u06E1\u0647\u064F \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0623\u06E1 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 40, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062A\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0648\u06E1 \u0623\u064E\u062A\u064E\u062A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u0623\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0628\u064E\u0644\u06E1 \u0625\u0650\u064A\u0651\u064E\u0627\u0647\u064F \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0641\u064E\u064A\u064E\u0643\u06E1\u0634\u0650\u0641\u064F \u0645\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u062A\u064E\u0646\u0633\u064E\u0648\u06E1\u0646\u064E \u0645\u064E\u0627 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u064E\u0645\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0623\u06E1\u0633\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u0636\u0651\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0636\u064E\u0631\u0651\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0628\u064E\u0623\u06E1\u0633\u064F\u0646\u064E\u0627 \u062A\u064E\u0636\u064E\u0631\u0651\u064E\u0639\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0642\u064E\u0633\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0632\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0646\u064E\u0633\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0630\u064F\u0643\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u062A\u064E\u062D\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u064E \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0641\u064E\u0631\u0650\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u064F\u0628\u06E1\u0644\u0650\u0633\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0641\u064E\u0642\u064F\u0637\u0650\u0639\u064E \u062F\u064E\u0627\u0628\u0650\u0631\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u06E1\u0639\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u062E\u064E\u062A\u064E\u0645\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06D7 \u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0646\u064F\u0635\u064E\u0631\u0651\u0650\u0641\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u062B\u064F\u0645\u0651\u064E \u0647\u064F\u0645\u06E1 \u064A\u064E\u0635\u06E1\u062F\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062A\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u062C\u064E\u0647\u06E1\u0631\u064E\u0629\u064B \u0647\u064E\u0644\u06E1 \u064A\u064F\u0647\u06E1\u0644\u064E\u0643\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0645\u064E\u0627 \u0646\u064F\u0631\u06E1\u0633\u0650\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0645\u064F\u0646\u0630\u0650\u0631\u0650\u064A\u0646\u064E\u06D6 \u0641\u064E\u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064E \u0641\u064E\u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u064A\u064E\u0645\u064E\u0633\u0651\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0633\u064F\u0642\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u0650\u064A \u062E\u064E\u0632\u064E\u0627\u0653\u0626\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064E\u0644\u064E\u0643\u064C\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u0651\u064E\u06DA \u0642\u064F\u0644\u06E1 \u0647\u064E\u0644\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0635\u0650\u064A\u0631\u064F\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0648\u064E\u0623\u064E\u0646\u0630\u0650\u0631\u06E1 \u0628\u0650\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u0650\u064A\u0651\u065E \u0648\u064E\u0644\u064E\u0627 \u0634\u064E\u0641\u0650\u064A\u0639\u065E \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0637\u06E1\u0631\u064F\u062F\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u062F\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0634\u0650\u064A\u0651\u0650 \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u062C\u06E1\u0647\u064E\u0647\u064F\u06E5\u06D6 \u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646\u06E1 \u062D\u0650\u0633\u064E\u0627\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0645\u064E\u0627 \u0645\u0650\u0646\u06E1 \u062D\u0650\u0633\u064E\u0627\u0628\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u062A\u064E\u0637\u06E1\u0631\u064F\u062F\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 53, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u062A\u064E\u0646\u0651\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u0645 \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0644\u0651\u0650\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650\u0646\u064E\u0627\u0653\u06D7 \u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0628\u0650\u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0642\u064F\u0644\u06E1 \u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06D6 \u0643\u064E\u062A\u064E\u0628\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646\u06E1 \u0639\u064E\u0645\u0650\u0644\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064E\u06E2\u0627 \u0628\u0650\u062C\u064E\u0647\u064E\u0670\u0644\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0627\u0628\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064E \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 55, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u0641\u064E\u0635\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0648\u064E\u0644\u0650\u062A\u064E\u0633\u06E1\u062A\u064E\u0628\u0650\u064A\u0646\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 56, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0646\u064F\u0647\u0650\u064A\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0642\u064F\u0644 \u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u064E\u0644\u06E1\u062A\u064F \u0625\u0650\u0630\u0657\u0627 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 57, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u06DA \u0645\u064E\u0627 \u0639\u0650\u0646\u062F\u0650\u064A \u0645\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0650 \u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06D6 \u064A\u064E\u0642\u064F\u0635\u0651\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u0641\u064E\u0670\u0635\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 58, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0639\u0650\u0646\u062F\u0650\u064A \u0645\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0644\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 59, text: "\u06DE\u0648\u064E\u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0645\u064E\u0641\u064E\u0627\u062A\u0650\u062D\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06DA \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0633\u06E1\u0642\u064F\u0637\u064F \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0642\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062D\u064E\u0628\u0651\u064E\u0629\u0656 \u0641\u0650\u064A \u0638\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u0631\u064E\u0637\u06E1\u0628\u0656 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0627\u0628\u0650\u0633\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 60, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062C\u064E\u0631\u064E\u062D\u06E1\u062A\u064F\u0645 \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0644\u0650\u064A\u064F\u0642\u06E1\u0636\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u065E \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649\u06D6 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 61, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0642\u064E\u0627\u0647\u0650\u0631\u064F \u0641\u064E\u0648\u06E1\u0642\u064E \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062D\u064E\u0641\u064E\u0638\u064E\u0629\u064B \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u062D\u064E\u062F\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u062A\u064E\u0648\u064E\u0641\u0651\u064E\u062A\u06E1\u0647\u064F \u0631\u064F\u0633\u064F\u0644\u064F\u0646\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0641\u064E\u0631\u0651\u0650\u0637\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u062B\u064F\u0645\u0651\u064E \u0631\u064F\u062F\u0651\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0623\u064E\u0644\u064E\u0627 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064F \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0633\u06E1\u0631\u064E\u0639\u064F \u0671\u0644\u06E1\u062D\u064E\u0670\u0633\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 63, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646 \u064A\u064F\u0646\u064E\u062C\u0651\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0638\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u062A\u064E\u0636\u064E\u0631\u0651\u064F\u0639\u0657\u0627 \u0648\u064E\u062E\u064F\u0641\u06E1\u064A\u064E\u0629\u0657 \u0644\u0651\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0646\u062C\u064E\u0649\u0670\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0644\u064E\u0646\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 64, text: "\u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0646\u064E\u062C\u0651\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0643\u064E\u0631\u06E1\u0628\u0656 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u0642\u064F\u0644\u06E1 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0642\u064E\u0627\u062F\u0650\u0631\u064F \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0645\u0651\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650 \u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u064A\u064E\u0644\u06E1\u0628\u0650\u0633\u064E\u0643\u064F\u0645\u06E1 \u0634\u0650\u064A\u064E\u0639\u0657\u0627 \u0648\u064E\u064A\u064F\u0630\u0650\u064A\u0642\u064E \u0628\u064E\u0639\u06E1\u0636\u064E\u0643\u064F\u0645 \u0628\u064E\u0623\u06E1\u0633\u064E \u0628\u064E\u0639\u06E1\u0636\u064D\u06D7 \u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0646\u064F\u0635\u064E\u0631\u0651\u0650\u0641\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0628\u0650\u0647\u0650\u06E6 \u0642\u064E\u0648\u06E1\u0645\u064F\u0643\u064E \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06DA \u0642\u064F\u0644 \u0644\u0651\u064E\u0633\u06E1\u062A\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0628\u0650\u0648\u064E\u0643\u0650\u064A\u0644\u0656" }, { id: 67, text: "\u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0646\u064E\u0628\u064E\u0625\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u065E\u06DA \u0648\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062E\u064F\u0648\u0636\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u062E\u064F\u0648\u0636\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062D\u064E\u062F\u0650\u064A\u062B\u064D \u063A\u064E\u064A\u06E1\u0631\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u064A\u064F\u0646\u0633\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0639\u064F\u062F\u06E1 \u0628\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 69, text: "\u0648\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1 \u062D\u0650\u0633\u064E\u0627\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0648\u064E\u0630\u064E\u0631\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u062F\u0650\u064A\u0646\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0639\u0650\u0628\u0657\u0627 \u0648\u064E\u0644\u064E\u0647\u06E1\u0648\u0657\u0627 \u0648\u064E\u063A\u064E\u0631\u0651\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06DA \u0648\u064E\u0630\u064E\u0643\u0651\u0650\u0631\u06E1 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646 \u062A\u064F\u0628\u06E1\u0633\u064E\u0644\u064E \u0646\u064E\u0641\u06E1\u0633\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064E\u0627 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u064A\u0651\u065E \u0648\u064E\u0644\u064E\u0627 \u0634\u064E\u0641\u0650\u064A\u0639\u065E \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0639\u06E1\u062F\u0650\u0644\u06E1 \u0643\u064F\u0644\u0651\u064E \u0639\u064E\u062F\u06E1\u0644\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u062E\u064E\u0630\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u0653\u06D7 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0628\u06E1\u0633\u0650\u0644\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652\u06D6 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0634\u064E\u0631\u064E\u0627\u0628\u065E \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u0645\u0650\u064A\u0645\u0656 \u0648\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0646\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0646\u064E\u0627 \u0648\u064E\u0646\u064F\u0631\u064E\u062F\u0651\u064F \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0639\u06E1\u0642\u064E\u0627\u0628\u0650\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0630\u06E1 \u0647\u064E\u062F\u064E\u0649\u0670\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0671\u0633\u06E1\u062A\u064E\u0647\u06E1\u0648\u064E\u062A\u06E1\u0647\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062D\u064E\u064A\u06E1\u0631\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u065E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649 \u0671\u0626\u06E1\u062A\u0650\u0646\u064E\u0627\u06D7 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0647\u064F\u062F\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670\u06D6 \u0648\u064E\u0623\u064F\u0645\u0650\u0631\u06E1\u0646\u064E\u0627 \u0644\u0650\u0646\u064F\u0633\u06E1\u0644\u0650\u0645\u064E \u0644\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 72, text: "\u0648\u064E\u0623\u064E\u0646\u06E1 \u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0647\u064F\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0643\u064F\u0646 \u0641\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F\u06DA \u0642\u064E\u0648\u06E1\u0644\u064F\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06DA \u0648\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064F \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0646\u0641\u064E\u062E\u064F \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u0648\u0631\u0650\u06DA \u0639\u064E\u0670\u0644\u0650\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 74, text: "\u06DE\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064F \u0644\u0650\u0623\u064E\u0628\u0650\u064A\u0647\u0650 \u0621\u064E\u0627\u0632\u064E\u0631\u064E \u0623\u064E\u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F \u0623\u064E\u0635\u06E1\u0646\u064E\u0627\u0645\u064B\u0627 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u064B \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064E\u0643\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 75, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u0631\u0650\u064A\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0645\u064E\u0644\u064E\u0643\u064F\u0648\u062A\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u0650\u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0648\u0642\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 76, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064F \u0631\u064E\u0621\u064E\u0627 \u0643\u064E\u0648\u06E1\u0643\u064E\u0628\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0631\u064E\u0628\u0651\u0650\u064A\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0641\u064E\u0644\u064E \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0627\u0653 \u0623\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0623\u0653\u0641\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 77, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0621\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E \u0628\u064E\u0627\u0632\u0650\u063A\u0657\u0627 \u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0631\u064E\u0628\u0651\u0650\u064A\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0641\u064E\u0644\u064E \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0626\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0647\u06E1\u062F\u0650\u0646\u0650\u064A \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u0623\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0636\u0651\u064E\u0627\u0653\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 78, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0621\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0628\u064E\u0627\u0632\u0650\u063A\u064E\u0629\u0657 \u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0631\u064E\u0628\u0651\u0650\u064A \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0641\u064E\u0644\u064E\u062A\u06E1 \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0628\u064E\u0631\u0650\u064A\u0653\u0621\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 79, text: "\u0625\u0650\u0646\u0651\u0650\u064A \u0648\u064E\u062C\u0651\u064E\u0647\u06E1\u062A\u064F \u0648\u064E\u062C\u06E1\u0647\u0650\u064A\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u064E\u0637\u064E\u0631\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u062D\u064E\u0646\u0650\u064A\u0641\u0657\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 80, text: "\u0648\u064E\u062D\u064E\u0627\u0653\u062C\u0651\u064E\u0647\u064F\u06E5 \u0642\u064E\u0648\u06E1\u0645\u064F\u0647\u064F\u06E5\u06DA \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u062A\u064F\u062D\u064E\u0640\u0670\u0653\u062C\u0651\u064F\u0648\u0653\u0646\u0651\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0647\u064E\u062F\u064E\u0649\u0670\u0646\u0650\u06DA \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0645\u064E\u0627 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06DA \u0648\u064E\u0633\u0650\u0639\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u0650\u0644\u06E1\u0645\u064B\u0627\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0648\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0645\u064E\u0627\u0653 \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u06E1\u062A\u064F\u0645 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627\u06DA \u0641\u064E\u0623\u064E\u064A\u0651\u064F \u0671\u0644\u06E1\u0641\u064E\u0631\u0650\u064A\u0642\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u062D\u064E\u0642\u0651\u064F \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0646\u0650\u06D6 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 82, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0644\u06E1\u0628\u0650\u0633\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0638\u064F\u0644\u06E1\u0645\u064D \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0646\u064F \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u062D\u064F\u062C\u0651\u064E\u062A\u064F\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u06DA \u0646\u064E\u0631\u06E1\u0641\u064E\u0639\u064F \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u0656 \u0645\u0651\u064E\u0646 \u0646\u0651\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u062D\u064E\u0643\u0650\u064A\u0645\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 84, text: "\u0648\u064E\u0648\u064E\u0647\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E\u06DA \u0643\u064F\u0644\u0651\u064B\u0627 \u0647\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627\u06DA \u0648\u064E\u0646\u064F\u0648\u062D\u064B\u0627 \u0647\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0648\u064E\u0645\u0650\u0646 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u0650\u0647\u0650\u06E6 \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0648\u064E\u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0648\u064E\u0623\u064E\u064A\u0651\u064F\u0648\u0628\u064E \u0648\u064E\u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0648\u064E\u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 85, text: "\u0648\u064E\u0632\u064E\u0643\u064E\u0631\u0650\u064A\u0651\u064E\u0627 \u0648\u064E\u064A\u064E\u062D\u06E1\u064A\u064E\u0649\u0670 \u0648\u064E\u0639\u0650\u064A\u0633\u064E\u0649\u0670 \u0648\u064E\u0625\u0650\u0644\u06E1\u064A\u064E\u0627\u0633\u064E\u06D6 \u0643\u064F\u0644\u0651\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 86, text: "\u0648\u064E\u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0633\u064E\u0639\u064E \u0648\u064E\u064A\u064F\u0648\u0646\u064F\u0633\u064E \u0648\u064E\u0644\u064F\u0648\u0637\u0657\u0627\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u0657\u0627 \u0641\u064E\u0636\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 87, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0640\u0670\u062A\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0671\u062C\u06E1\u062A\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 88, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u062F\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0627\u0652 \u0644\u064E\u062D\u064E\u0628\u0650\u0637\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 89, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064F\u0628\u064F\u0648\u0651\u064E\u0629\u064E\u06DA \u0641\u064E\u0625\u0650\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u06E1 \u0628\u0650\u0647\u064E\u0627 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0644\u0651\u064E\u064A\u06E1\u0633\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627 \u0628\u0650\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 90, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u062F\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0641\u064E\u0628\u0650\u0647\u064F\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0642\u06E1\u062A\u064E\u062F\u0650\u0647\u06E1\u06D7 \u0642\u064F\u0644 \u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u062C\u06E1\u0631\u064B\u0627\u06D6 \u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 91, text: "\u0648\u064E\u0645\u064E\u0627 \u0642\u064E\u062F\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062D\u064E\u0642\u0651\u064E \u0642\u064E\u062F\u06E1\u0631\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0634\u064E\u0631\u0656 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06D7 \u0642\u064F\u0644\u06E1 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0647\u0650\u06E6 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0646\u064F\u0648\u0631\u0657\u0627 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06D6 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0642\u064E\u0631\u064E\u0627\u0637\u0650\u064A\u0633\u064E \u062A\u064F\u0628\u06E1\u062F\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0648\u064E\u062A\u064F\u062E\u06E1\u0641\u064F\u0648\u0646\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627\u06D6 \u0648\u064E\u0639\u064F\u0644\u0651\u0650\u0645\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u062B\u064F\u0645\u0651\u064E \u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u062E\u064E\u0648\u06E1\u0636\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0644\u06E1\u0639\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 92, text: "\u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u064C \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u064F\u0628\u064E\u0627\u0631\u064E\u0643\u065E \u0645\u0651\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0644\u0650\u062A\u064F\u0646\u0630\u0650\u0631\u064E \u0623\u064F\u0645\u0651\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0646\u06E1 \u062D\u064E\u0648\u06E1\u0644\u064E\u0647\u064E\u0627\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0635\u064E\u0644\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u062D\u064E\u0627\u0641\u0650\u0638\u064F\u0648\u0646\u064E" }, { id: 93, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0642\u064E\u0627\u0644\u064E \u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0648\u062D\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0634\u064E\u064A\u06E1\u0621\u065E \u0648\u064E\u0645\u064E\u0646 \u0642\u064E\u0627\u0644\u064E \u0633\u064E\u0623\u064F\u0646\u0632\u0650\u0644\u064F \u0645\u0650\u062B\u06E1\u0644\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0648\u064E\u0644\u064E\u0648\u06E1 \u062A\u064E\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u063A\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0628\u064E\u0627\u0633\u0650\u0637\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064E\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u064F\u06D6 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u0647\u064F\u0648\u0646\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u062A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 94, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E\u0627 \u0641\u064F\u0631\u064E\u0670\u062F\u064E\u0649\u0670 \u0643\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u0656 \u0648\u064E\u062A\u064E\u0631\u064E\u0643\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u062E\u064E\u0648\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E \u0638\u064F\u0647\u064F\u0648\u0631\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u0631\u064E\u0649\u0670 \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0634\u064F\u0641\u064E\u0639\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0632\u064E\u0639\u064E\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u0634\u064F\u0631\u064E\u0643\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652\u06DA \u0644\u064E\u0642\u064E\u062F \u062A\u0651\u064E\u0642\u064E\u0637\u0651\u064E\u0639\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0632\u06E1\u0639\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 95, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0627\u0644\u0650\u0642\u064F \u0671\u0644\u06E1\u062D\u064E\u0628\u0651\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0648\u064E\u0649\u0670\u06D6 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u064A\u0651\u0650\u062A\u0650 \u0648\u064E\u0645\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u0651\u0650\u062A\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u062A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 96, text: "\u0641\u064E\u0627\u0644\u0650\u0642\u064F \u0671\u0644\u06E1\u0625\u0650\u0635\u06E1\u0628\u064E\u0627\u062D\u0650 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0633\u064E\u0643\u064E\u0646\u0657\u0627 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E \u062D\u064F\u0633\u06E1\u0628\u064E\u0627\u0646\u0657\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062A\u064E\u0642\u06E1\u062F\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u0650" }, { id: 97, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064F\u062C\u064F\u0648\u0645\u064E \u0644\u0650\u062A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627 \u0641\u0650\u064A \u0638\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650\u06D7 \u0642\u064E\u062F\u06E1 \u0641\u064E\u0635\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 98, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0634\u064E\u0623\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0656 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0656 \u0641\u064E\u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u065E \u0648\u064E\u0645\u064F\u0633\u06E1\u062A\u064E\u0648\u06E1\u062F\u064E\u0639\u065E\u06D7 \u0642\u064E\u062F\u06E1 \u0641\u064E\u0635\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 99, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0646\u064E\u0628\u064E\u0627\u062A\u064E \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F \u062E\u064E\u0636\u0650\u0631\u0657\u0627 \u0646\u0651\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0645\u0650\u0646\u06E1\u0647\u064F \u062D\u064E\u0628\u0651\u0657\u0627 \u0645\u0651\u064F\u062A\u064E\u0631\u064E\u0627\u0643\u0650\u0628\u0657\u0627 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u062E\u06E1\u0644\u0650 \u0645\u0650\u0646 \u0637\u064E\u0644\u06E1\u0639\u0650\u0647\u064E\u0627 \u0642\u0650\u0646\u06E1\u0648\u064E\u0627\u0646\u065E \u062F\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u065E \u0648\u064E\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0646\u064E\u0627\u0628\u0656 \u0648\u064E\u0671\u0644\u0632\u0651\u064E\u064A\u06E1\u062A\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u0631\u0651\u064F\u0645\u0651\u064E\u0627\u0646\u064E \u0645\u064F\u0634\u06E1\u062A\u064E\u0628\u0650\u0647\u0657\u0627 \u0648\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u062A\u064E\u0634\u064E\u0670\u0628\u0650\u0647\u064D\u06D7 \u0671\u0646\u0638\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u062B\u064E\u0645\u064E\u0631\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u062B\u06E1\u0645\u064E\u0631\u064E \u0648\u064E\u064A\u064E\u0646\u06E1\u0639\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 100, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064E \u0648\u064E\u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u062E\u064E\u0631\u064E\u0642\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0628\u064E\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0628\u064E\u0646\u064E\u0670\u062A\u0650\u06ED \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u0656\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649\u0670 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 101, text: "\u0628\u064E\u062F\u0650\u064A\u0639\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u062F\u065E \u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0635\u064E\u0670\u062D\u0650\u0628\u064E\u0629\u065E\u06D6 \u0648\u064E\u062E\u064E\u0644\u064E\u0642\u064E \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u0656\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 102, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u062E\u064E\u0670\u0644\u0650\u0642\u064F \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0647\u064F\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0643\u0650\u064A\u0644\u065E" }, { id: 103, text: "\u0644\u0651\u064E\u0627 \u062A\u064F\u062F\u06E1\u0631\u0650\u0643\u064F\u0647\u064F \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064F\u062F\u06E1\u0631\u0650\u0643\u064F \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064E\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0637\u0650\u064A\u0641\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 104, text: "\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645 \u0628\u064E\u0635\u064E\u0627\u0653\u0626\u0650\u0631\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0628\u06E1\u0635\u064E\u0631\u064E \u0641\u064E\u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0639\u064E\u0645\u0650\u064A\u064E \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0628\u0650\u062D\u064E\u0641\u0650\u064A\u0638\u0656" }, { id: 105, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u0635\u064E\u0631\u0651\u0650\u0641\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0648\u064E\u0644\u0650\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u062F\u064E\u0631\u064E\u0633\u06E1\u062A\u064E \u0648\u064E\u0644\u0650\u0646\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0647\u064F\u06E5 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 106, text: "\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0648\u064E\u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 107, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627\u0653 \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062D\u064E\u0641\u0650\u064A\u0638\u0657\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0648\u064E\u0643\u0650\u064A\u0644\u0656" }, { id: 108, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u064F\u0628\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u064A\u064E\u0633\u064F\u0628\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u062F\u06E1\u0648\u064E\u06E2\u0627 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u0656\u06D7 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0632\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0627 \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u064D \u0639\u064E\u0645\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 109, text: "\u0648\u064E\u0623\u064E\u0642\u06E1\u0633\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0647\u06E1\u062F\u064E \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0626\u0650\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u065E \u0644\u0651\u064E\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0646\u0651\u064E \u0628\u0650\u0647\u064E\u0627\u06DA \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u064F \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0634\u06E1\u0639\u0650\u0631\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064E\u0627\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 110, text: "\u0648\u064E\u0646\u064F\u0642\u064E\u0644\u0651\u0650\u0628\u064F \u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u062A\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u0656 \u0648\u064E\u0646\u064E\u0630\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0637\u064F\u063A\u06E1\u064A\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0645\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 111, text: "\u06DE\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0646\u064E\u0627 \u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064E \u0648\u064E\u0643\u064E\u0644\u0651\u064E\u0645\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u0648\u064E\u062D\u064E\u0634\u064E\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064F\u0628\u064F\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062C\u06E1\u0647\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 112, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0646\u064E\u0628\u0650\u064A\u0651\u064D \u0639\u064E\u062F\u064F\u0648\u0651\u0657\u0627 \u0634\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650 \u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u064A\u064F\u0648\u062D\u0650\u064A \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u0632\u064F\u062E\u06E1\u0631\u064F\u0641\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u063A\u064F\u0631\u064F\u0648\u0631\u0657\u0627\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0645\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u064F\u0648\u0647\u064F\u06D6 \u0641\u064E\u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 113, text: "\u0648\u064E\u0644\u0650\u062A\u064E\u0635\u06E1\u063A\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u0629\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0644\u0650\u064A\u064E\u0631\u06E1\u0636\u064E\u0648\u06E1\u0647\u064F \u0648\u064E\u0644\u0650\u064A\u064E\u0642\u06E1\u062A\u064E\u0631\u0650\u0641\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u064F\u0642\u06E1\u062A\u064E\u0631\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 114, text: "\u0623\u064E\u0641\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0628\u06E1\u062A\u064E\u063A\u0650\u064A \u062D\u064E\u0643\u064E\u0645\u0657\u0627 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u064F\u0641\u064E\u0635\u0651\u064E\u0644\u0657\u0627\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u064F\u0646\u064E\u0632\u0651\u064E\u0644\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0645\u06E1\u062A\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 115, text: "\u0648\u064E\u062A\u064E\u0645\u0651\u064E\u062A\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0635\u0650\u062F\u06E1\u0642\u0657\u0627 \u0648\u064E\u0639\u064E\u062F\u06E1\u0644\u0657\u0627\u06DA \u0644\u0651\u064E\u0627 \u0645\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064E \u0644\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 116, text: "\u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0637\u0650\u0639\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0648\u0643\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0638\u0651\u064E\u0646\u0651\u064E \u0648\u064E\u0625\u0650\u0646\u06E1 \u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u064A\u064E\u062E\u06E1\u0631\u064F\u0635\u064F\u0648\u0646\u064E" }, { id: 117, text: "\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0646 \u064A\u064E\u0636\u0650\u0644\u0651\u064F \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 118, text: "\u0641\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0630\u064F\u0643\u0650\u0631\u064E \u0671\u0633\u06E1\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 119, text: "\u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0630\u064F\u0643\u0650\u0631\u064E \u0671\u0633\u06E1\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0641\u064E\u0635\u0651\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0671\u0636\u06E1\u0637\u064F\u0631\u0650\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0644\u0651\u064E\u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0648\u0646\u064E \u0628\u0650\u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0639\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 120, text: "\u0648\u064E\u0630\u064E\u0631\u064F\u0648\u0627\u0652 \u0638\u064E\u0670\u0647\u0650\u0631\u064E \u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650 \u0648\u064E\u0628\u064E\u0627\u0637\u0650\u0646\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u064E \u0633\u064E\u064A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0642\u06E1\u062A\u064E\u0631\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 121, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064F\u0630\u06E1\u0643\u064E\u0631\u0650 \u0671\u0633\u06E1\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0641\u0650\u0633\u06E1\u0642\u065E\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064E \u0644\u064E\u064A\u064F\u0648\u062D\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0644\u0650\u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0648\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0637\u064E\u0639\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 122, text: "\u0623\u064E\u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u064A\u06E1\u062A\u0657\u0627 \u0641\u064E\u0623\u064E\u062D\u06E1\u064A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0646\u064F\u0648\u0631\u0657\u0627 \u064A\u064E\u0645\u06E1\u0634\u0650\u064A \u0628\u0650\u0647\u0650\u06E6 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0643\u064E\u0645\u064E\u0646 \u0645\u0651\u064E\u062B\u064E\u0644\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0644\u064E\u064A\u06E1\u0633\u064E \u0628\u0650\u062E\u064E\u0627\u0631\u0650\u062C\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0632\u064F\u064A\u0651\u0650\u0646\u064E \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 123, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0643\u064F\u0644\u0651\u0650 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0623\u064E\u0643\u064E\u0670\u0628\u0650\u0631\u064E \u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0647\u064E\u0627 \u0644\u0650\u064A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 124, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u065E \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u0646\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0646\u064F\u0624\u06E1\u062A\u064E\u0649\u0670 \u0645\u0650\u062B\u06E1\u0644\u064E \u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0631\u064F\u0633\u064F\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D8 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u062D\u064E\u064A\u06E1\u062B\u064F \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0631\u0650\u0633\u064E\u0627\u0644\u064E\u062A\u064E\u0647\u064F\u06E5\u06D7 \u0633\u064E\u064A\u064F\u0635\u0650\u064A\u0628\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u062C\u06E1\u0631\u064E\u0645\u064F\u0648\u0627\u0652 \u0635\u064E\u063A\u064E\u0627\u0631\u064C \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 125, text: "\u0641\u064E\u0645\u064E\u0646 \u064A\u064F\u0631\u0650\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u06E5 \u064A\u064E\u0634\u06E1\u0631\u064E\u062D\u06E1 \u0635\u064E\u062F\u06E1\u0631\u064E\u0647\u064F\u06E5 \u0644\u0650\u0644\u06E1\u0625\u0650\u0633\u06E1\u0644\u064E\u0670\u0645\u0650\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0631\u0650\u062F\u06E1 \u0623\u064E\u0646 \u064A\u064F\u0636\u0650\u0644\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0635\u064E\u062F\u06E1\u0631\u064E\u0647\u064F\u06E5 \u0636\u064E\u064A\u0651\u0650\u0642\u064B\u0627 \u062D\u064E\u0631\u064E\u062C\u0657\u0627 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0635\u0651\u064E\u0639\u0651\u064E\u062F\u064F \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0631\u0651\u0650\u062C\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 126, text: "\u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0635\u0650\u0631\u064E\u0670\u0637\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0657\u0627\u06D7 \u0642\u064E\u062F\u06E1 \u0641\u064E\u0635\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 127, text: "\u06DE\u0644\u064E\u0647\u064F\u0645\u06E1 \u062F\u064E\u0627\u0631\u064F \u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0670\u0645\u0650 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0648\u064E\u0644\u0650\u064A\u0651\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 128, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u062D\u06E1\u0634\u064F\u0631\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u064A\u064E\u0670\u0645\u064E\u0639\u06E1\u0634\u064E\u0631\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0642\u064E\u062F\u0650 \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u062B\u064E\u0631\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0645\u06E1\u062A\u064E\u0639\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0646\u064E\u0627 \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0648\u064E\u0628\u064E\u0644\u064E\u063A\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u062C\u064E\u0644\u064E\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u062C\u0651\u064E\u0644\u06E1\u062A\u064E \u0644\u064E\u0646\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0645\u064E\u062B\u06E1\u0648\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u062D\u064E\u0643\u0650\u064A\u0645\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 129, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u0648\u064E\u0644\u0651\u0650\u064A \u0628\u064E\u0639\u06E1\u0636\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0628\u064E\u0639\u06E1\u0636\u064E\u06E2\u0627 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 130, text: "\u064A\u064E\u0670\u0645\u064E\u0639\u06E1\u0634\u064E\u0631\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650 \u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u0643\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u065E \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u064A\u064E\u0642\u064F\u0635\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u0648\u064E\u064A\u064F\u0646\u0630\u0650\u0631\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E \u064A\u064E\u0648\u06E1\u0645\u0650\u0643\u064F\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0634\u064E\u0647\u0650\u062F\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0646\u064E\u0627\u06D6 \u0648\u064E\u063A\u064E\u0631\u0651\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0634\u064E\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 131, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0631\u0651\u064E\u0628\u0651\u064F\u0643\u064E \u0645\u064F\u0647\u06E1\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670 \u0628\u0650\u0638\u064F\u0644\u06E1\u0645\u0656 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064F\u0647\u064E\u0627 \u063A\u064E\u0670\u0641\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 132, text: "\u0648\u064E\u0644\u0650\u0643\u064F\u0644\u0651\u0656 \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0645\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0628\u0650\u063A\u064E\u0670\u0641\u0650\u0644\u064D \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 133, text: "\u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0671\u0644\u06E1\u063A\u064E\u0646\u0650\u064A\u0651\u064F \u0630\u064F\u0648 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u0650\u06DA \u0625\u0650\u0646 \u064A\u064E\u0634\u064E\u0623\u06E1 \u064A\u064F\u0630\u06E1\u0647\u0650\u0628\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0644\u0650\u0641\u06E1 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0634\u064E\u0623\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u0650 \u0642\u064E\u0648\u06E1\u0645\u064D \u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 134, text: "\u0625\u0650\u0646\u0651\u064E \u0645\u064E\u0627 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E \u0644\u064E\u0623\u0653\u062A\u0656\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A\u0646\u064E" }, { id: 135, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0639\u064E\u0627\u0645\u0650\u0644\u065E\u06D6 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 136, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0645\u0651\u064E\u0627 \u0630\u064E\u0631\u064E\u0623\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u06E1\u062B\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0646\u064E\u0635\u0650\u064A\u0628\u0657\u0627 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0632\u064E\u0639\u06E1\u0645\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u0650\u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0626\u0650\u0646\u064E\u0627\u06D6 \u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0635\u0650\u0644\u064F \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0647\u064F\u0648\u064E \u064A\u064E\u0635\u0650\u0644\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 137, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0632\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u0650\u0643\u064E\u062B\u0650\u064A\u0631\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0642\u064E\u062A\u06E1\u0644\u064E \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u0650\u0647\u0650\u0645\u06E1 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A\u064F\u0631\u06E1\u062F\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u064A\u064E\u0644\u06E1\u0628\u0650\u0633\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062F\u0650\u064A\u0646\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u064F\u0648\u0647\u064F\u06D6 \u0641\u064E\u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 138, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u065E \u0648\u064E\u062D\u064E\u0631\u06E1\u062B\u064C \u062D\u0650\u062C\u06E1\u0631\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0637\u06E1\u0639\u064E\u0645\u064F\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0646\u0651\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0628\u0650\u0632\u064E\u0639\u06E1\u0645\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u064C \u062D\u064F\u0631\u0651\u0650\u0645\u064E\u062A\u06E1 \u0638\u064F\u0647\u064F\u0648\u0631\u064F\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E \u0671\u0633\u06E1\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0671\u0641\u06E1\u062A\u0650\u0631\u064E\u0627\u0653\u0621\u064B \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0633\u064E\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u0647\u0650\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 139, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0641\u0650\u064A \u0628\u064F\u0637\u064F\u0648\u0646\u0650 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u062E\u064E\u0627\u0644\u0650\u0635\u064E\u0629\u065E \u0644\u0651\u0650\u0630\u064F\u0643\u064F\u0648\u0631\u0650\u0646\u064E\u0627 \u0648\u064E\u0645\u064F\u062D\u064E\u0631\u0651\u064E\u0645\u064C \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0646\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0643\u064F\u0646 \u0645\u0651\u064E\u064A\u06E1\u062A\u064E\u0629\u0657 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064F\u06DA \u0633\u064E\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0635\u06E1\u0641\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u062D\u064E\u0643\u0650\u064A\u0645\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 140, text: "\u0642\u064E\u062F\u06E1 \u062E\u064E\u0633\u0650\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u062A\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u0641\u064E\u0647\u064E\u06E2\u0627 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u0656 \u0648\u064E\u062D\u064E\u0631\u0651\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0641\u06E1\u062A\u0650\u0631\u064E\u0627\u0653\u0621\u064B \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 141, text: "\u06DE\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0634\u064E\u0623\u064E \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0645\u0651\u064E\u0639\u06E1\u0631\u064F\u0648\u0634\u064E\u0670\u062A\u0656 \u0648\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0634\u064E\u0670\u062A\u0656 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u062E\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u0632\u0651\u064E\u0631\u06E1\u0639\u064E \u0645\u064F\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064B\u0627 \u0623\u064F\u0643\u064F\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u0632\u0651\u064E\u064A\u06E1\u062A\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u0631\u0651\u064F\u0645\u0651\u064E\u0627\u0646\u064E \u0645\u064F\u062A\u064E\u0634\u064E\u0670\u0628\u0650\u0647\u0657\u0627 \u0648\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u062A\u064E\u0634\u064E\u0670\u0628\u0650\u0647\u0656\u06DA \u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062B\u064E\u0645\u064E\u0631\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u062B\u06E1\u0645\u064E\u0631\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u062D\u064E\u0642\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0648\u06E1\u0645\u064E \u062D\u064E\u0635\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0633\u06E1\u0631\u0650\u0641\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 142, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u062D\u064E\u0645\u064F\u0648\u0644\u064E\u0629\u0657 \u0648\u064E\u0641\u064E\u0631\u06E1\u0634\u0657\u0627\u06DA \u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u062E\u064F\u0637\u064F\u0648\u064E\u0670\u062A\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 143, text: "\u062B\u064E\u0645\u064E\u0670\u0646\u0650\u064A\u064E\u0629\u064E \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0656\u06D6 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0636\u0651\u064E\u0623\u06E1\u0646\u0650 \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0632\u0650 \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650\u06D7 \u0642\u064F\u0644\u06E1 \u0621\u064E\u0627\u0653\u0644\u0630\u0651\u064E\u0643\u064E\u0631\u064E\u064A\u06E1\u0646\u0650 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0623\u064E\u0645\u0650 \u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u064A\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0634\u06E1\u062A\u064E\u0645\u064E\u0644\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u064F \u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u064A\u064E\u064A\u06E1\u0646\u0650\u06D6 \u0646\u064E\u0628\u0651\u0650\u0640\u0654\u064F\u0648\u0646\u0650\u064A \u0628\u0650\u0639\u0650\u0644\u06E1\u0645\u064D \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 144, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u0628\u0650\u0644\u0650 \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u0642\u064E\u0631\u0650 \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650\u06D7 \u0642\u064F\u0644\u06E1 \u0621\u064E\u0627\u0653\u0644\u0630\u0651\u064E\u0643\u064E\u0631\u064E\u064A\u06E1\u0646\u0650 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0623\u064E\u0645\u0650 \u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u064A\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0634\u06E1\u062A\u064E\u0645\u064E\u0644\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u064F \u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u064A\u064E\u064A\u06E1\u0646\u0650\u06D6 \u0623\u064E\u0645\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u0630\u06E1 \u0648\u064E\u0635\u0651\u064E\u0649\u0670\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627\u06DA \u0641\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u0657\u0627 \u0644\u0651\u0650\u064A\u064F\u0636\u0650\u0644\u0651\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 145, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u062C\u0650\u062F\u064F \u0641\u0650\u064A \u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0645\u064F\u062D\u064E\u0631\u0651\u064E\u0645\u064B\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0637\u064E\u0627\u0639\u0650\u0645\u0656 \u064A\u064E\u0637\u06E1\u0639\u064E\u0645\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u064E\u064A\u06E1\u062A\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u062F\u064E\u0645\u0657\u0627 \u0645\u0651\u064E\u0633\u06E1\u0641\u064F\u0648\u062D\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0644\u064E\u062D\u06E1\u0645\u064E \u062E\u0650\u0646\u0632\u0650\u064A\u0631\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0631\u0650\u062C\u06E1\u0633\u064C \u0623\u064E\u0648\u06E1 \u0641\u0650\u0633\u06E1\u0642\u064B\u0627 \u0623\u064F\u0647\u0650\u0644\u0651\u064E \u0644\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0647\u0650\u06E6\u06DA \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0636\u06E1\u0637\u064F\u0631\u0651\u064E \u063A\u064E\u064A\u06E1\u0631\u064E \u0628\u064E\u0627\u063A\u0656 \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0627\u062F\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 146, text: "\u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u062D\u064E\u0631\u0651\u064E\u0645\u06E1\u0646\u064E\u0627 \u0643\u064F\u0644\u0651\u064E \u0630\u0650\u064A \u0638\u064F\u0641\u064F\u0631\u0656\u06D6 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u0642\u064E\u0631\u0650 \u0648\u064E\u0671\u0644\u06E1\u063A\u064E\u0646\u064E\u0645\u0650 \u062D\u064E\u0631\u0651\u064E\u0645\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0634\u064F\u062D\u064F\u0648\u0645\u064E\u0647\u064F\u0645\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u062D\u064E\u0645\u064E\u0644\u064E\u062A\u06E1 \u0638\u064F\u0647\u064F\u0648\u0631\u064F\u0647\u064F\u0645\u064E\u0627\u0653 \u0623\u064E\u0648\u0650 \u0671\u0644\u06E1\u062D\u064E\u0648\u064E\u0627\u064A\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0645\u064E\u0627 \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0637\u064E \u0628\u0650\u0639\u064E\u0638\u06E1\u0645\u0656\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0628\u064E\u063A\u06E1\u064A\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0635\u064E\u0670\u062F\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 147, text: "\u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0643\u064E \u0641\u064E\u0642\u064F\u0644 \u0631\u0651\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0630\u064F\u0648 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0656 \u0648\u064E\u0670\u0633\u0650\u0639\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0631\u064E\u062F\u0651\u064F \u0628\u064E\u0623\u06E1\u0633\u064F\u0647\u064F\u06E5 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 148, text: "\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627\u0653 \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0627\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0630\u064E\u0627\u0642\u064F\u0648\u0627\u0652 \u0628\u064E\u0623\u06E1\u0633\u064E\u0646\u064E\u0627\u06D7 \u0642\u064F\u0644\u06E1 \u0647\u064E\u0644\u06E1 \u0639\u0650\u0646\u062F\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0644\u06E1\u0645\u0656 \u0641\u064E\u062A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0647\u064F \u0644\u064E\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0638\u0651\u064E\u0646\u0651\u064E \u0648\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u062E\u06E1\u0631\u064F\u0635\u064F\u0648\u0646\u064E" }, { id: 149, text: "\u0642\u064F\u0644\u06E1 \u0641\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u062D\u064F\u062C\u0651\u064E\u0629\u064F \u0671\u0644\u06E1\u0628\u064E\u0670\u0644\u0650\u063A\u064E\u0629\u064F\u06D6 \u0641\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0644\u064E\u0647\u064E\u062F\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 150, text: "\u0642\u064F\u0644\u06E1 \u0647\u064E\u0644\u064F\u0645\u0651\u064E \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0647\u064E\u0670\u0630\u064E\u0627\u06D6 \u0641\u064E\u0625\u0650\u0646 \u0634\u064E\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0634\u06E1\u0647\u064E\u062F\u06E1 \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0647\u064F\u0645 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 151, text: "\u06DE\u0642\u064F\u0644\u06E1 \u062A\u064E\u0639\u064E\u0627\u0644\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u062A\u06E1\u0644\u064F \u0645\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06D6 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06D6 \u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0646\u0650 \u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0645\u06E1\u0644\u064E\u0670\u0642\u0656 \u0646\u0651\u064E\u062D\u06E1\u0646\u064F \u0646\u064E\u0631\u06E1\u0632\u064F\u0642\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u064A\u0651\u064E\u0627\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0641\u064E\u0648\u064E\u0670\u062D\u0650\u0634\u064E \u0645\u064E\u0627 \u0638\u064E\u0647\u064E\u0631\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u0637\u064E\u0646\u064E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0641\u06E1\u0633\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0635\u0651\u064E\u0649\u0670\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 152, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u064A\u064E\u062A\u0650\u064A\u0645\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0647\u0650\u064A\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0628\u06E1\u0644\u064F\u063A\u064E \u0623\u064E\u0634\u064F\u062F\u0651\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0623\u064E\u0648\u06E1\u0641\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u0650\u064A\u0632\u064E\u0627\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650\u06D6 \u0644\u064E\u0627 \u0646\u064F\u0643\u064E\u0644\u0651\u0650\u0641\u064F \u0646\u064E\u0641\u06E1\u0633\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064F\u0633\u06E1\u0639\u064E\u0647\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064F\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0671\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0627 \u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670\u06D6 \u0648\u064E\u0628\u0650\u0639\u064E\u0647\u06E1\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0648\u06E1\u0641\u064F\u0648\u0627\u0652\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0635\u0651\u064E\u0649\u0670\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 153, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0635\u0650\u0631\u064E\u0670\u0637\u0650\u064A \u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0657\u0627 \u0641\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0647\u064F\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064F\u0628\u064F\u0644\u064E \u0641\u064E\u062A\u064E\u0641\u064E\u0631\u0651\u064E\u0642\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0635\u0651\u064E\u0649\u0670\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 154, text: "\u062B\u064F\u0645\u0651\u064E \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u062A\u064E\u0645\u064E\u0627\u0645\u064B\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0648\u064E\u062A\u064E\u0641\u06E1\u0635\u0650\u064A\u0644\u0657\u0627 \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645 \u0628\u0650\u0644\u0650\u0642\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 155, text: "\u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u064C \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u064F\u0628\u064E\u0627\u0631\u064E\u0643\u065E \u0641\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0647\u064F \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0631\u06E1\u062D\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 156, text: "\u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E\u0627 \u0639\u064E\u0646 \u062F\u0650\u0631\u064E\u0627\u0633\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u063A\u064E\u0670\u0641\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 157, text: "\u0623\u064E\u0648\u06E1 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064F \u0644\u064E\u0643\u064F\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0647\u06E1\u062F\u064E\u0649\u0670 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06DA \u0641\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E\u06DA \u0641\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0635\u064E\u062F\u064E\u0641\u064E \u0639\u064E\u0646\u06E1\u0647\u064E\u0627\u06D7 \u0633\u064E\u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0635\u06E1\u062F\u0650\u0641\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0633\u064F\u0648\u0653\u0621\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0635\u06E1\u062F\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 158, text: "\u0647\u064E\u0644\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0623\u064E\u0648\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0623\u064E\u0648\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0628\u064E\u0639\u06E1\u0636\u064F \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06D7 \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0623\u06E1\u062A\u0650\u064A \u0628\u064E\u0639\u06E1\u0636\u064F \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F \u0646\u064E\u0641\u06E1\u0633\u064B\u0627 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064F\u0647\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0623\u064E\u0648\u06E1 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0641\u0650\u064A\u0653 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0647\u064E\u0627 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627\u06D7 \u0642\u064F\u0644\u0650 \u0671\u0646\u062A\u064E\u0638\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064F\u0646\u062A\u064E\u0638\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 159, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u064E\u0631\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u062F\u0650\u064A\u0646\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0634\u0650\u064A\u064E\u0639\u0657\u0627 \u0644\u0651\u064E\u0633\u06E1\u062A\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0634\u064E\u064A\u06E1\u0621\u064D\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 160, text: "\u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0650 \u0641\u064E\u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0634\u06E1\u0631\u064F \u0623\u064E\u0645\u06E1\u062B\u064E\u0627\u0644\u0650\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0650 \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u062C\u06E1\u0632\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u062B\u06E1\u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 161, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0646\u0650\u064A \u0647\u064E\u062F\u064E\u0649\u0670\u0646\u0650\u064A \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656 \u062F\u0650\u064A\u0646\u0657\u0627 \u0642\u0650\u064A\u064E\u0645\u0657\u0627 \u0645\u0651\u0650\u0644\u0651\u064E\u0629\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u062D\u064E\u0646\u0650\u064A\u0641\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 162, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0635\u064E\u0644\u064E\u0627\u062A\u0650\u064A \u0648\u064E\u0646\u064F\u0633\u064F\u0643\u0650\u064A \u0648\u064E\u0645\u064E\u062D\u06E1\u064A\u064E\u0627\u064A\u064E \u0648\u064E\u0645\u064E\u0645\u064E\u0627\u062A\u0650\u064A \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 163, text: "\u0644\u064E\u0627 \u0634\u064E\u0631\u0650\u064A\u0643\u064E \u0644\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0628\u0650\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0623\u064E\u0648\u0651\u064E\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 164, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0628\u06E1\u063A\u0650\u064A \u0631\u064E\u0628\u0651\u0657\u0627 \u0648\u064E\u0647\u064F\u0648\u064E \u0631\u064E\u0628\u0651\u064F \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0632\u0650\u0631\u064F \u0648\u064E\u0627\u0632\u0650\u0631\u064E\u0629\u065E \u0648\u0650\u0632\u06E1\u0631\u064E \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u06DA \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u062A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 165, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u062E\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0641\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0631\u064E\u0641\u064E\u0639\u064E \u0628\u064E\u0639\u06E1\u0636\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0648\u06E1\u0642\u064E \u0628\u064E\u0639\u06E1\u0636\u0656 \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u064A\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0633\u064E\u0631\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F\u06E2" }] }, { id: 7, name: "\u0627\u0644\u0623\u0639\u0631\u0627\u0641", transliteration: "Al-A'raf", type: "meccan", total_verses: 206, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0645\u0653\u0635\u0653" }, { id: 2, text: "\u0643\u0650\u062A\u064E\u0670\u0628\u064C \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0643\u064F\u0646 \u0641\u0650\u064A \u0635\u064E\u062F\u06E1\u0631\u0650\u0643\u064E \u062D\u064E\u0631\u064E\u062C\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0644\u0650\u062A\u064F\u0646\u0630\u0650\u0631\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 3, text: "\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E\u06D7 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0648\u064E\u0643\u064E\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0641\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064E\u0627 \u0628\u064E\u0623\u06E1\u0633\u064F\u0646\u064E\u0627 \u0628\u064E\u064A\u064E\u0670\u062A\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0653\u0626\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u062F\u064E\u0639\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0628\u064E\u0623\u06E1\u0633\u064F\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0638\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 6, text: "\u0641\u064E\u0644\u064E\u0646\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0646\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0641\u064E\u0644\u064E\u0646\u064E\u0642\u064F\u0635\u0651\u064E\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0639\u0650\u0644\u06E1\u0645\u0656\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u063A\u064E\u0627\u0653\u0626\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u0648\u064E\u0671\u0644\u06E1\u0648\u064E\u0632\u06E1\u0646\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06DA \u0641\u064E\u0645\u064E\u0646 \u062B\u064E\u0642\u064F\u0644\u064E\u062A\u06E1 \u0645\u064E\u0648\u064E\u0670\u0632\u0650\u064A\u0646\u064F\u0647\u064F\u06E5 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u062E\u064E\u0641\u0651\u064E\u062A\u06E1 \u0645\u064E\u0648\u064E\u0670\u0632\u0650\u064A\u0646\u064F\u0647\u064F\u06E5 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0633\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0645\u064E\u0643\u0651\u064E\u0646\u0651\u064E\u0640\u0670\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0639\u064E\u0670\u064A\u0650\u0634\u064E\u06D7 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0635\u064E\u0648\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0671\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652 \u0644\u0650\u0623\u0653\u062F\u064E\u0645\u064E \u0641\u064E\u0633\u064E\u062C\u064E\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0640\u0670\u062C\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 12, text: "\u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0627 \u0645\u064E\u0646\u064E\u0639\u064E\u0643\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0633\u06E1\u062C\u064F\u062F\u064E \u0625\u0650\u0630\u06E1 \u0623\u064E\u0645\u064E\u0631\u06E1\u062A\u064F\u0643\u064E\u06D6 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0646\u064E\u0627\u06E0 \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064E\u0646\u0650\u064A \u0645\u0650\u0646 \u0646\u0651\u064E\u0627\u0631\u0656 \u0648\u064E\u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0637\u0650\u064A\u0646\u0656" }, { id: 13, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0671\u0647\u06E1\u0628\u0650\u0637\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0641\u064E\u0645\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u064E\u0643\u064E \u0623\u064E\u0646 \u062A\u064E\u062A\u064E\u0643\u064E\u0628\u0651\u064E\u0631\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u0671\u062E\u06E1\u0631\u064F\u062C\u06E1 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u063A\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0646\u0638\u0650\u0631\u06E1\u0646\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u064A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u0638\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 16, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0648\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0644\u064E\u0623\u064E\u0642\u06E1\u0639\u064F\u062F\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0635\u0650\u0631\u064E\u0670\u0637\u064E\u0643\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u064E" }, { id: 17, text: "\u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0623\u0653\u062A\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0639\u064E\u0646\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0639\u064E\u0646 \u0634\u064E\u0645\u064E\u0627\u0653\u0626\u0650\u0644\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u0650\u062F\u064F \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0634\u064E\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u062E\u06E1\u0631\u064F\u062C\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0645\u064E\u0630\u06E1\u0621\u064F\u0648\u0645\u0657\u0627 \u0645\u0651\u064E\u062F\u06E1\u062D\u064F\u0648\u0631\u0657\u0627\u06D6 \u0644\u0651\u064E\u0645\u064E\u0646 \u062A\u064E\u0628\u0650\u0639\u064E\u0643\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u064E\u0623\u064E\u0645\u06E1\u0644\u064E\u0623\u064E\u0646\u0651\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u064A\u064E\u0640\u0670\u0653\u0640\u0654\u064E\u0627\u062F\u064E\u0645\u064F \u0671\u0633\u06E1\u0643\u064F\u0646\u06E1 \u0623\u064E\u0646\u062A\u064E \u0648\u064E\u0632\u064E\u0648\u06E1\u062C\u064F\u0643\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0641\u064E\u0643\u064F\u0644\u064E\u0627 \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0634\u0650\u0626\u06E1\u062A\u064F\u0645\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0631\u064E\u0628\u064E\u0627 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u064E\u0629\u064E \u0641\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 20, text: "\u0641\u064E\u0648\u064E\u0633\u06E1\u0648\u064E\u0633\u064E \u0644\u064E\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0644\u0650\u064A\u064F\u0628\u06E1\u062F\u0650\u064A\u064E \u0644\u064E\u0647\u064F\u0645\u064E\u0627 \u0645\u064E\u0627 \u0648\u064F\u06E5\u0631\u0650\u064A\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0645\u0650\u0646 \u0633\u064E\u0648\u06E1\u0621\u064E\u0670\u062A\u0650\u0647\u0650\u0645\u064E\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0627 \u0646\u064E\u0647\u064E\u0649\u0670\u0643\u064F\u0645\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u064E\u0627 \u0639\u064E\u0646\u06E1 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u064E\u0629\u0650 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u0648\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0642\u064E\u0627\u0633\u064E\u0645\u064E\u0647\u064F\u0645\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645\u064E\u0627 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0640\u0670\u0635\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 22, text: "\u0641\u064E\u062F\u064E\u0644\u0651\u064E\u0649\u0670\u0647\u064F\u0645\u064E\u0627 \u0628\u0650\u063A\u064F\u0631\u064F\u0648\u0631\u0656\u06DA \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0630\u064E\u0627\u0642\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u064E\u0629\u064E \u0628\u064E\u062F\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u0645\u064E\u0627 \u0633\u064E\u0648\u06E1\u0621\u064E\u0670\u062A\u064F\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u0637\u064E\u0641\u0650\u0642\u064E\u0627 \u064A\u064E\u062E\u06E1\u0635\u0650\u0641\u064E\u0627\u0646\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064E\u0627 \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0642\u0650 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650\u06D6 \u0648\u064E\u0646\u064E\u0627\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u064E\u0627\u0653 \u0623\u064E\u0644\u064E\u0645\u06E1 \u0623\u064E\u0646\u06E1\u0647\u064E\u0643\u064F\u0645\u064E\u0627 \u0639\u064E\u0646 \u062A\u0650\u0644\u06E1\u0643\u064F\u0645\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u064E\u0629\u0650 \u0648\u064E\u0623\u064E\u0642\u064F\u0644 \u0644\u0651\u064E\u0643\u064F\u0645\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u064E\u0627 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 23, text: "\u0642\u064E\u0627\u0644\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u062A\u064E\u0631\u06E1\u062D\u064E\u0645\u06E1\u0646\u064E\u0627 \u0644\u064E\u0646\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 24, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0647\u06E1\u0628\u0650\u0637\u064F\u0648\u0627\u0652 \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645\u06E1 \u0644\u0650\u0628\u064E\u0639\u06E1\u0636\u064D \u0639\u064E\u062F\u064F\u0648\u0651\u065E\u06D6 \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u065E \u0648\u064E\u0645\u064E\u062A\u064E\u0670\u0639\u064C \u0625\u0650\u0644\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 25, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u062A\u064E\u062D\u06E1\u064A\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0641\u0650\u064A\u0647\u064E\u0627 \u062A\u064E\u0645\u064F\u0648\u062A\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062A\u064F\u062E\u06E1\u0631\u064E\u062C\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0642\u064E\u062F\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0644\u0650\u0628\u064E\u0627\u0633\u0657\u0627 \u064A\u064F\u0648\u064E\u0670\u0631\u0650\u064A \u0633\u064E\u0648\u06E1\u0621\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u0650\u064A\u0634\u0657\u0627\u06D6 \u0648\u064E\u0644\u0650\u0628\u064E\u0627\u0633\u064F \u0671\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u065E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0644\u064E\u0627 \u064A\u064E\u0641\u06E1\u062A\u0650\u0646\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u0623\u064E\u0628\u064E\u0648\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u064A\u064E\u0646\u0632\u0650\u0639\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0644\u0650\u0628\u064E\u0627\u0633\u064E\u0647\u064F\u0645\u064E\u0627 \u0644\u0650\u064A\u064F\u0631\u0650\u064A\u064E\u0647\u064F\u0645\u064E\u0627 \u0633\u064E\u0648\u06E1\u0621\u064E\u0670\u062A\u0650\u0647\u0650\u0645\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0631\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0647\u064F\u0648\u064E \u0648\u064E\u0642\u064E\u0628\u0650\u064A\u0644\u064F\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0644\u064E\u0627 \u062A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064E \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u0657 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0645\u064E\u0631\u064E\u0646\u064E\u0627 \u0628\u0650\u0647\u064E\u0627\u06D7 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F \u0628\u0650\u0671\u0644\u06E1\u0641\u064E\u062D\u06E1\u0634\u064E\u0627\u0653\u0621\u0650\u06D6 \u0623\u064E\u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0645\u064E\u0631\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650\u06D6 \u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0643\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0656 \u0648\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0647\u064F \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u0650\u064A\u0646\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E\u06DA \u0643\u064E\u0645\u064E\u0627 \u0628\u064E\u062F\u064E\u0623\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0639\u064F\u0648\u062F\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0641\u064E\u0631\u0650\u064A\u0642\u064B\u0627 \u0647\u064E\u062F\u064E\u0649\u0670 \u0648\u064E\u0641\u064E\u0631\u0650\u064A\u0642\u064B\u0627 \u062D\u064E\u0642\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0636\u0651\u064E\u0644\u064E\u0670\u0644\u064E\u0629\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064E \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u06DE\u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u062E\u064F\u0630\u064F\u0648\u0627\u0652 \u0632\u0650\u064A\u0646\u064E\u062A\u064E\u0643\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0656 \u0648\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0634\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0633\u06E1\u0631\u0650\u0641\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646\u06E1 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0632\u0650\u064A\u0646\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u0644\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u0650\u06DA \u0642\u064F\u0644\u06E1 \u0647\u0650\u064A\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062E\u064E\u0627\u0644\u0650\u0635\u064E\u0629\u0657 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06D7 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u0641\u064E\u0635\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0631\u064E\u0628\u0651\u0650\u064A\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u064E\u0670\u062D\u0650\u0634\u064E \u0645\u064E\u0627 \u0638\u064E\u0647\u064E\u0631\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u0637\u064E\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u064E \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u063A\u06E1\u064A\u064E \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0623\u064E\u0646 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u064D \u0623\u064E\u062C\u064E\u0644\u065E\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u062C\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0623\u06E1\u062E\u0650\u0631\u064F\u0648\u0646\u064E \u0633\u064E\u0627\u0639\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0642\u06E1\u062F\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0625\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u065E \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u064A\u064E\u0642\u064F\u0635\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0642\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064E \u0641\u064E\u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0641\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u0653\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064E\u0646\u064E\u0627\u0644\u064F\u0647\u064F\u0645\u06E1 \u0646\u064E\u0635\u0650\u064A\u0628\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0646\u064E\u0627 \u064A\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u0646\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u0651\u064E\u0627 \u0648\u064E\u0634\u064E\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0653 \u0623\u064F\u0645\u064E\u0645\u0656 \u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627 \u062F\u064E\u062E\u064E\u0644\u064E\u062A\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u065E \u0644\u0651\u064E\u0639\u064E\u0646\u064E\u062A\u06E1 \u0623\u064F\u062E\u06E1\u062A\u064E\u0647\u064E\u0627\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0671\u062F\u0651\u064E\u0627\u0631\u064E\u0643\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0644\u0650\u0623\u064F\u0648\u0644\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u0636\u064E\u0644\u0651\u064F\u0648\u0646\u064E\u0627 \u0641\u064E\u0640\u0654\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0636\u0650\u0639\u06E1\u0641\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0643\u064F\u0644\u0651\u0656 \u0636\u0650\u0639\u06E1\u0641\u065E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0623\u064F\u0648\u0644\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0644\u0650\u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0656 \u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0644\u064E\u0627 \u062A\u064F\u0641\u064E\u062A\u0651\u064E\u062D\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0644\u0650\u062C\u064E \u0671\u0644\u06E1\u062C\u064E\u0645\u064E\u0644\u064F \u0641\u0650\u064A \u0633\u064E\u0645\u0651\u0650 \u0671\u0644\u06E1\u062E\u0650\u064A\u064E\u0627\u0637\u0650\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0645\u0650\u0647\u064E\u0627\u062F\u065E \u0648\u064E\u0645\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u0650\u0645\u06E1 \u063A\u064E\u0648\u064E\u0627\u0634\u0656\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 42, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0627 \u0646\u064F\u0643\u064E\u0644\u0651\u0650\u0641\u064F \u0646\u064E\u0641\u06E1\u0633\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064F\u0633\u06E1\u0639\u064E\u0647\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0646\u064E\u0632\u064E\u0639\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u063A\u0650\u0644\u0651\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0647\u064E\u062F\u064E\u0649\u0670\u0646\u064E\u0627 \u0644\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0644\u0650\u0646\u064E\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u064E \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1 \u0647\u064E\u062F\u064E\u0649\u0670\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u0648\u064E\u0646\u064F\u0648\u062F\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u062A\u0650\u0644\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064F \u0623\u064F\u0648\u0631\u0650\u062B\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0648\u064E\u0646\u064E\u0627\u062F\u064E\u0649\u0670\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0623\u064E\u0646 \u0642\u064E\u062F\u06E1 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0648\u064E\u0639\u064E\u062F\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u062D\u064E\u0642\u0651\u0657\u0627 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0648\u064E\u062C\u064E\u062F\u062A\u0651\u064F\u0645 \u0645\u0651\u064E\u0627 \u0648\u064E\u0639\u064E\u062F\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u062D\u064E\u0642\u0651\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0646\u064E\u0639\u064E\u0645\u06E1\u06DA \u0641\u064E\u0623\u064E\u0630\u0651\u064E\u0646\u064E \u0645\u064F\u0624\u064E\u0630\u0651\u0650\u0646\u064F\u06E2 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u0644\u0651\u064E\u0639\u06E1\u0646\u064E\u0629\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 45, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0639\u0650\u0648\u064E\u062C\u0657\u0627 \u0648\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u062D\u0650\u062C\u064E\u0627\u0628\u065E\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0641\u0650 \u0631\u0650\u062C\u064E\u0627\u0644\u065E \u064A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E \u0643\u064F\u0644\u0651\u064E\u06E2\u0627 \u0628\u0650\u0633\u0650\u064A\u0645\u064E\u0649\u0670\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0646\u064E\u0627\u062F\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0623\u064E\u0646 \u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06DA \u0644\u064E\u0645\u06E1 \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0637\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u06DE\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0635\u064F\u0631\u0650\u0641\u064E\u062A\u06E1 \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F\u0647\u064F\u0645\u06E1 \u062A\u0650\u0644\u06E1\u0642\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0646\u064E\u0627\u062F\u064E\u0649\u0670\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0641\u0650 \u0631\u0650\u062C\u064E\u0627\u0644\u0657\u0627 \u064A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0633\u0650\u064A\u0645\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670 \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u062C\u064E\u0645\u06E1\u0639\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0623\u064E\u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0642\u06E1\u0633\u064E\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0646\u064E\u0627\u0644\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u064D\u06DA \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0648\u064E\u0646\u064E\u0627\u062F\u064E\u0649\u0670\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0641\u0650\u064A\u0636\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u0648\u06E1 \u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062D\u064E\u0631\u0651\u064E\u0645\u064E\u0647\u064F\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 51, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u062F\u0650\u064A\u0646\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u06E1\u0648\u0657\u0627 \u0648\u064E\u0644\u064E\u0639\u0650\u0628\u0657\u0627 \u0648\u064E\u063A\u064E\u0631\u0651\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06DA \u0641\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u0646\u0633\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627 \u0646\u064E\u0633\u064F\u0648\u0627\u0652 \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E \u064A\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u064A\u064E\u062C\u06E1\u062D\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0641\u064E\u0635\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u0650\u0644\u06E1\u0645\u064D \u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0647\u064E\u0644\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u064E\u0647\u064F\u06E5\u06DA \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0623\u06E1\u062A\u0650\u064A \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u064F\u0647\u064F\u06E5 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0646\u064E\u0633\u064F\u0648\u0647\u064F \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0641\u064E\u0647\u064E\u0644 \u0644\u0651\u064E\u0646\u064E\u0627 \u0645\u0650\u0646 \u0634\u064F\u0641\u064E\u0639\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u064A\u064E\u0634\u06E1\u0641\u064E\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0646\u064F\u0631\u064E\u062F\u0651\u064F \u0641\u064E\u0646\u064E\u0639\u06E1\u0645\u064E\u0644\u064E \u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u06DA \u0642\u064E\u062F\u06E1 \u062E\u064E\u0633\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0641\u0650\u064A \u0633\u0650\u062A\u0651\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650\u06D6 \u064A\u064F\u063A\u06E1\u0634\u0650\u064A \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u064A\u064E\u0637\u06E1\u0644\u064F\u0628\u064F\u0647\u064F\u06E5 \u062D\u064E\u062B\u0650\u064A\u062B\u0657\u0627 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064F\u062C\u064F\u0648\u0645\u064E \u0645\u064F\u0633\u064E\u062E\u0651\u064E\u0631\u064E\u0670\u062A\u0650\u06ED \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6\u0653\u06D7 \u0623\u064E\u0644\u064E\u0627 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F\u06D7 \u062A\u064E\u0628\u064E\u0627\u0631\u064E\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 55, text: "\u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0636\u064E\u0631\u0651\u064F\u0639\u0657\u0627 \u0648\u064E\u062E\u064F\u0641\u06E1\u064A\u064E\u0629\u064B\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0639\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 56, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0635\u06E1\u0644\u064E\u0670\u062D\u0650\u0647\u064E\u0627 \u0648\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0647\u064F \u062E\u064E\u0648\u06E1\u0641\u0657\u0627 \u0648\u064E\u0637\u064E\u0645\u064E\u0639\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0642\u064E\u0631\u0650\u064A\u0628\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 57, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064F \u0671\u0644\u0631\u0651\u0650\u064A\u064E\u0670\u062D\u064E \u0628\u064F\u0634\u06E1\u0631\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1 \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0642\u064E\u0644\u0651\u064E\u062A\u06E1 \u0633\u064E\u062D\u064E\u0627\u0628\u0657\u0627 \u062B\u0650\u0642\u064E\u0627\u0644\u0657\u0627 \u0633\u064F\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0644\u0650\u0628\u064E\u0644\u064E\u062F\u0656 \u0645\u0651\u064E\u064A\u0651\u0650\u062A\u0656 \u0641\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u062F\u064F \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064F \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0646\u064E\u0628\u064E\u0627\u062A\u064F\u0647\u064F\u06E5 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0628\u064F\u062B\u064E \u0644\u064E\u0627 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u0643\u0650\u062F\u0657\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u0635\u064E\u0631\u0651\u0650\u0641\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0646\u064F\u0648\u062D\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u063A\u064E\u064A\u06E1\u0631\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 60, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 61, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064E\u064A\u06E1\u0633\u064E \u0628\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u0650\u064A \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 62, text: "\u0623\u064F\u0628\u064E\u0644\u0651\u0650\u063A\u064F\u0643\u064F\u0645\u06E1 \u0631\u0650\u0633\u064E\u0670\u0644\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0623\u064E\u0646\u0635\u064E\u062D\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0623\u064E\u0648\u064E\u0639\u064E\u062C\u0650\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0630\u0650\u0643\u06E1\u0631\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u062C\u064F\u0644\u0656 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0644\u0650\u064A\u064F\u0646\u0630\u0650\u0631\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0631\u06E1\u062D\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F \u0641\u064E\u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u0648\u064E\u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064B\u0627 \u0639\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 65, text: "\u06DE\u0648\u064E\u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0627\u062F\u064D \u0623\u064E\u062E\u064E\u0627\u0647\u064F\u0645\u06E1 \u0647\u064F\u0648\u062F\u0657\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u063A\u064E\u064A\u06E1\u0631\u064F\u0647\u064F\u06E5\u0653\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u0641\u0650\u064A \u0633\u064E\u0641\u064E\u0627\u0647\u064E\u0629\u0656 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u0638\u064F\u0646\u0651\u064F\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 67, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064E\u064A\u06E1\u0633\u064E \u0628\u0650\u064A \u0633\u064E\u0641\u064E\u0627\u0647\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u0650\u064A \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 68, text: "\u0623\u064F\u0628\u064E\u0644\u0651\u0650\u063A\u064F\u0643\u064F\u0645\u06E1 \u0631\u0650\u0633\u064E\u0670\u0644\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0646\u064E\u0627\u0635\u0650\u062D\u064C \u0623\u064E\u0645\u0650\u064A\u0646\u064C" }, { id: 69, text: "\u0623\u064E\u0648\u064E\u0639\u064E\u062C\u0650\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0630\u0650\u0643\u06E1\u0631\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u062C\u064F\u0644\u0656 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0644\u0650\u064A\u064F\u0646\u0630\u0650\u0631\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u06E1 \u062C\u064E\u0639\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u062E\u064F\u0644\u064E\u0641\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0642\u064E\u0648\u06E1\u0645\u0650 \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0632\u064E\u0627\u062F\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u0650 \u0628\u064E\u0635\u06DC\u06E1\u0637\u064E\u0629\u0657\u06D6 \u0641\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062C\u0650\u0626\u06E1\u062A\u064E\u0646\u064E\u0627 \u0644\u0650\u0646\u064E\u0639\u06E1\u0628\u064F\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u062D\u06E1\u062F\u064E\u0647\u064F\u06E5 \u0648\u064E\u0646\u064E\u0630\u064E\u0631\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0641\u064E\u0623\u06E1\u062A\u0650\u0646\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u0650\u062F\u064F\u0646\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 71, text: "\u0642\u064E\u0627\u0644\u064E \u0642\u064E\u062F\u06E1 \u0648\u064E\u0642\u064E\u0639\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0631\u0650\u062C\u06E1\u0633\u065E \u0648\u064E\u063A\u064E\u0636\u064E\u0628\u064C\u06D6 \u0623\u064E\u062A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0648\u0646\u064E\u0646\u0650\u064A \u0641\u0650\u064A\u0653 \u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0621\u0656 \u0633\u064E\u0645\u0651\u064E\u064A\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u064E\u0627 \u0645\u0650\u0646 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0656\u06DA \u0641\u064E\u0671\u0646\u062A\u064E\u0638\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064E\u0639\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u062A\u064E\u0638\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 72, text: "\u0641\u064E\u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u0642\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627 \u062F\u064E\u0627\u0628\u0650\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 73, text: "\u0648\u064E\u0625\u0650\u0644\u064E\u0649\u0670 \u062B\u064E\u0645\u064F\u0648\u062F\u064E \u0623\u064E\u062E\u064E\u0627\u0647\u064F\u0645\u06E1 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u063A\u064E\u064A\u06E1\u0631\u064F\u0647\u064F\u06E5\u06D6 \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0643\u064F\u0645 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0646\u064E\u0627\u0642\u064E\u0629\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u0657\u06D6 \u0641\u064E\u0630\u064E\u0631\u064F\u0648\u0647\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u0636\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u064E\u0633\u0651\u064F\u0648\u0647\u064E\u0627 \u0628\u0650\u0633\u064F\u0648\u0653\u0621\u0656 \u0641\u064E\u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 74, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u06E1 \u062C\u064E\u0639\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u062E\u064F\u0644\u064E\u0641\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0639\u064E\u0627\u062F\u0656 \u0648\u064E\u0628\u064E\u0648\u0651\u064E\u0623\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0633\u064F\u0647\u064F\u0648\u0644\u0650\u0647\u064E\u0627 \u0642\u064F\u0635\u064F\u0648\u0631\u0657\u0627 \u0648\u064E\u062A\u064E\u0646\u06E1\u062D\u0650\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064E \u0628\u064F\u064A\u064F\u0648\u062A\u0657\u0627\u06D6 \u0641\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062B\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 75, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064F\u0636\u06E1\u0639\u0650\u0641\u064F\u0648\u0627\u0652 \u0644\u0650\u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0645\u0651\u064F\u0631\u06E1\u0633\u064E\u0644\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0628\u0650\u0647\u0650\u06E6 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 77, text: "\u0641\u064E\u0639\u064E\u0642\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0627\u0642\u064E\u0629\u064E \u0648\u064E\u0639\u064E\u062A\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0635\u064E\u0670\u0644\u0650\u062D\u064F \u0671\u0626\u06E1\u062A\u0650\u0646\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u0650\u062F\u064F\u0646\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 78, text: "\u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u062C\u06E1\u0641\u064E\u0629\u064F \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062F\u064E\u0627\u0631\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0670\u062B\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 79, text: "\u0641\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0628\u06E1\u0644\u064E\u063A\u06E1\u062A\u064F\u0643\u064F\u0645\u06E1 \u0631\u0650\u0633\u064E\u0627\u0644\u064E\u0629\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0646\u064E\u0635\u064E\u062D\u06E1\u062A\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u064E\u0627 \u062A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0640\u0670\u0635\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 80, text: "\u0648\u064E\u0644\u064F\u0648\u0637\u064B\u0627 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u064E \u0645\u064E\u0627 \u0633\u064E\u0628\u064E\u0642\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 81, text: "\u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u062C\u064E\u0627\u0644\u064E \u0634\u064E\u0647\u06E1\u0648\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0645\u0651\u064F\u0633\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 82, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u062C\u064E\u0648\u064E\u0627\u0628\u064E \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u062A\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064F\u0646\u064E\u0627\u0633\u065E \u064A\u064E\u062A\u064E\u0637\u064E\u0647\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0641\u064E\u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 84, text: "\u0648\u064E\u0623\u064E\u0645\u06E1\u0637\u064E\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064E\u0637\u064E\u0631\u0657\u0627\u06D6 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 85, text: "\u0648\u064E\u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u062F\u06E1\u064A\u064E\u0646\u064E \u0623\u064E\u062E\u064E\u0627\u0647\u064F\u0645\u06E1 \u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u0657\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u063A\u064E\u064A\u06E1\u0631\u064F\u0647\u064F\u06E5\u06D6 \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0643\u064F\u0645 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0623\u064E\u0648\u06E1\u0641\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u0650\u064A\u0632\u064E\u0627\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u062E\u064E\u0633\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0623\u064E\u0634\u06E1\u064A\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0635\u06E1\u0644\u064E\u0670\u062D\u0650\u0647\u064E\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 86, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0639\u064F\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u062A\u064F\u0648\u0639\u0650\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u062A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u062A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0639\u0650\u0648\u064E\u062C\u0657\u0627\u06DA \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0641\u064E\u0643\u064E\u062B\u0651\u064E\u0631\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0671\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 87, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u06E1\u062A\u064F \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0644\u0651\u064E\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u062D\u064E\u0670\u0643\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 88, text: "\u06DE\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0644\u064E\u0646\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0646\u0651\u064E\u0643\u064E \u064A\u064E\u0670\u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u064F \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0643\u064E \u0645\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u062A\u0650\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0644\u064E\u062A\u064E\u0639\u064F\u0648\u062F\u064F\u0646\u0651\u064E \u0641\u0650\u064A \u0645\u0650\u0644\u0651\u064E\u062A\u0650\u0646\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064F\u0646\u0651\u064E\u0627 \u0643\u064E\u0670\u0631\u0650\u0647\u0650\u064A\u0646\u064E" }, { id: 89, text: "\u0642\u064E\u062F\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u064A\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u064B\u0627 \u0625\u0650\u0646\u06E1 \u0639\u064F\u062F\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0645\u0650\u0644\u0651\u064E\u062A\u0650\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0630\u06E1 \u0646\u064E\u062C\u0651\u064E\u0649\u0670\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064E\u0639\u064F\u0648\u062F\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627\u06DA \u0648\u064E\u0633\u0650\u0639\u064E \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u0650\u0644\u06E1\u0645\u064B\u0627\u06DA \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u0646\u064E\u0627\u06DA \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0671\u0641\u06E1\u062A\u064E\u062D\u06E1 \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E \u0642\u064E\u0648\u06E1\u0645\u0650\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u0641\u064E\u0670\u062A\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 90, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0644\u064E\u0626\u0650\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u06E1\u062A\u064F\u0645\u06E1 \u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u064B\u0627 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 91, text: "\u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u062C\u06E1\u0641\u064E\u0629\u064F \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062F\u064E\u0627\u0631\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0670\u062B\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 92, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u0657\u0627 \u0643\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u063A\u06E1\u0646\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u0657\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 93, text: "\u0641\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0628\u06E1\u0644\u064E\u063A\u06E1\u062A\u064F\u0643\u064F\u0645\u06E1 \u0631\u0650\u0633\u064E\u0670\u0644\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0646\u064E\u0635\u064E\u062D\u06E1\u062A\u064F \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0621\u064E\u0627\u0633\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0656 \u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 94, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064D \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0623\u06E1\u0633\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u0636\u0651\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0636\u0651\u064E\u0631\u0651\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 95, text: "\u062B\u064F\u0645\u0651\u064E \u0628\u064E\u062F\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0650 \u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0639\u064E\u0641\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0642\u064E\u062F\u06E1 \u0645\u064E\u0633\u0651\u064E \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0671\u0644\u0636\u0651\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u064F \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 96, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0644\u064E\u0641\u064E\u062A\u064E\u062D\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u064E\u0631\u064E\u0643\u064E\u0670\u062A\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u0623\u064E\u0641\u064E\u0623\u064E\u0645\u0650\u0646\u064E \u0623\u064E\u0647\u06E1\u0644\u064F \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645 \u0628\u064E\u0623\u06E1\u0633\u064F\u0646\u064E\u0627 \u0628\u064E\u064A\u064E\u0670\u062A\u0657\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0627\u0653\u0626\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 98, text: "\u0623\u064E\u0648\u064E\u0623\u064E\u0645\u0650\u0646\u064E \u0623\u064E\u0647\u06E1\u0644\u064F \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645 \u0628\u064E\u0623\u06E1\u0633\u064F\u0646\u064E\u0627 \u0636\u064F\u062D\u0657\u0649 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0644\u06E1\u0639\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 99, text: "\u0623\u064E\u0641\u064E\u0623\u064E\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0643\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u0645\u064E\u0646\u064F \u0645\u064E\u0643\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 100, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0647\u06E1\u062F\u0650 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0631\u0650\u062B\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u0646 \u0644\u0651\u064E\u0648\u06E1 \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0623\u064E\u0635\u064E\u0628\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0646\u064E\u0637\u06E1\u0628\u064E\u0639\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 101, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670 \u0646\u064E\u0642\u064F\u0635\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0627\u0653\u0626\u0650\u0647\u064E\u0627\u06DA \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0637\u06E1\u0628\u064E\u0639\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 102, text: "\u0648\u064E\u0645\u064E\u0627 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u0650\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0647\u06E1\u062F\u0656\u06D6 \u0648\u064E\u0625\u0650\u0646 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 103, text: "\u062B\u064F\u0645\u0651\u064E \u0628\u064E\u0639\u064E\u062B\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u0648\u0633\u064E\u0649\u0670 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0645\u064E\u0644\u064E\u0625\u0650\u064A\u0652\u0647\u0650\u06E6 \u0641\u064E\u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627\u06D6 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 104, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u064A\u064E\u0670\u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0625\u0650\u0646\u0651\u0650\u064A \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 105, text: "\u062D\u064E\u0642\u0650\u064A\u0642\u064C \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0642\u064F\u0648\u0644\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E\u06DA \u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064F\u0643\u064F\u0645 \u0628\u0650\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u0650\u0644\u06E1 \u0645\u064E\u0639\u0650\u064A\u064E \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E" }, { id: 106, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u062C\u0650\u0626\u06E1\u062A\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u0656 \u0641\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u0647\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 107, text: "\u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670 \u0639\u064E\u0635\u064E\u0627\u0647\u064F \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u0650\u064A\u064E \u062B\u064F\u0639\u06E1\u0628\u064E\u0627\u0646\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 108, text: "\u0648\u064E\u0646\u064E\u0632\u064E\u0639\u064E \u064A\u064E\u062F\u064E\u0647\u064F\u06E5 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0636\u064E\u0627\u0653\u0621\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0640\u0670\u0638\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 109, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0633\u064E\u0670\u062D\u0650\u0631\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 110, text: "\u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0636\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0645\u064E\u0627\u0630\u064E\u0627 \u062A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 111, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0631\u06E1\u062C\u0650\u0647\u06E1 \u0648\u064E\u0623\u064E\u062E\u064E\u0627\u0647\u064F \u0648\u064E\u0623\u064E\u0631\u06E1\u0633\u0650\u0644\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062F\u064E\u0627\u0653\u0626\u0650\u0646\u0650 \u062D\u064E\u0670\u0634\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 112, text: "\u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0643\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0633\u064E\u0670\u062D\u0650\u0631\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 113, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0631\u064E\u0629\u064F \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0646\u064E\u0627 \u0644\u064E\u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0644\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 114, text: "\u0642\u064E\u0627\u0644\u064E \u0646\u064E\u0639\u064E\u0645\u06E1 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0631\u0651\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 115, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064F\u0644\u06E1\u0642\u0650\u064A\u064E \u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064E\u0643\u064F\u0648\u0646\u064E \u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0642\u0650\u064A\u0646\u064E" }, { id: 116, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0644\u06E1\u0642\u064F\u0648\u0627\u0652\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0644\u06E1\u0642\u064E\u0648\u06E1\u0627\u0652 \u0633\u064E\u062D\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0631\u06E1\u0647\u064E\u0628\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064F\u0648 \u0628\u0650\u0633\u0650\u062D\u06E1\u0631\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 117, text: "\u06DE\u0648\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0644\u06E1\u0642\u0650 \u0639\u064E\u0635\u064E\u0627\u0643\u064E\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u0650\u064A\u064E \u062A\u064E\u0644\u06E1\u0642\u064E\u0641\u064F \u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u0641\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 118, text: "\u0641\u064E\u0648\u064E\u0642\u064E\u0639\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0628\u064E\u0637\u064E\u0644\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 119, text: "\u0641\u064E\u063A\u064F\u0644\u0650\u0628\u064F\u0648\u0627\u0652 \u0647\u064F\u0646\u064E\u0627\u0644\u0650\u0643\u064E \u0648\u064E\u0671\u0646\u0642\u064E\u0644\u064E\u0628\u064F\u0648\u0627\u0652 \u0635\u064E\u0670\u063A\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 120, text: "\u0648\u064E\u0623\u064F\u0644\u06E1\u0642\u0650\u064A\u064E \u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0631\u064E\u0629\u064F \u0633\u064E\u0670\u062C\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 121, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 122, text: "\u0631\u064E\u0628\u0651\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E" }, { id: 123, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0642\u064E\u0628\u06E1\u0644\u064E \u0623\u064E\u0646\u06E1 \u0621\u064E\u0627\u0630\u064E\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0645\u064E\u0643\u06E1\u0631\u065E \u0645\u0651\u064E\u0643\u064E\u0631\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u0644\u0650\u062A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064E\u0627\u06D6 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 124, text: "\u0644\u064E\u0623\u064F\u0642\u064E\u0637\u0651\u0650\u0639\u064E\u0646\u0651\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u0650\u0644\u064E\u0670\u0641\u0656 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0623\u064F\u0635\u064E\u0644\u0651\u0650\u0628\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 125, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0645\u064F\u0646\u0642\u064E\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 126, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0646\u0642\u0650\u0645\u064F \u0645\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0646\u064E\u0627\u06DA \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0641\u06E1\u0631\u0650\u063A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0635\u064E\u0628\u06E1\u0631\u0657\u0627 \u0648\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0646\u064E\u0627 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 127, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0623\u064E\u062A\u064E\u0630\u064E\u0631\u064F \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u06E5 \u0644\u0650\u064A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u064A\u064E\u0630\u064E\u0631\u064E\u0643\u064E \u0648\u064E\u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u064E\u0643\u064E\u06DA \u0642\u064E\u0627\u0644\u064E \u0633\u064E\u0646\u064F\u0642\u064E\u062A\u0651\u0650\u0644\u064F \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0646\u064E\u0633\u06E1\u062A\u064E\u062D\u06E1\u064A\u0650\u06E6 \u0646\u0650\u0633\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0641\u064E\u0648\u06E1\u0642\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0670\u0647\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 128, text: "\u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650 \u0671\u0633\u06E1\u062A\u064E\u0639\u0650\u064A\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0653\u0627\u0652\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u064A\u064F\u0648\u0631\u0650\u062B\u064F\u0647\u064E\u0627 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 129, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064F\u0648\u0630\u0650\u064A\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u064E\u0627 \u0648\u064E\u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u0650\u0626\u06E1\u062A\u064E\u0646\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u0639\u064E\u0633\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064F\u0647\u06E1\u0644\u0650\u0643\u064E \u0639\u064E\u062F\u064F\u0648\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0644\u0650\u0641\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u064A\u064E\u0646\u0638\u064F\u0631\u064E \u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 130, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0628\u0650\u0671\u0644\u0633\u0651\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0646\u064E\u0642\u06E1\u0635\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 131, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u064F \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0646\u064E\u0627 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0635\u0650\u0628\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u065E \u064A\u064E\u0637\u0651\u064E\u064A\u0651\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0646 \u0645\u0651\u064E\u0639\u064E\u0647\u064F\u06E5\u0653\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0637\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u064F\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 132, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0647\u06E1\u0645\u064E\u0627 \u062A\u064E\u0623\u06E1\u062A\u0650\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u0656 \u0644\u0651\u0650\u062A\u064E\u0633\u06E1\u062D\u064E\u0631\u064E\u0646\u064E\u0627 \u0628\u0650\u0647\u064E\u0627 \u0641\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0644\u064E\u0643\u064E \u0628\u0650\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 133, text: "\u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0637\u0651\u064F\u0648\u0641\u064E\u0627\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u062C\u064E\u0631\u064E\u0627\u062F\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064F\u0645\u0651\u064E\u0644\u064E \u0648\u064E\u0671\u0644\u0636\u0651\u064E\u0641\u064E\u0627\u062F\u0650\u0639\u064E \u0648\u064E\u0671\u0644\u062F\u0651\u064E\u0645\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0656 \u0645\u0651\u064F\u0641\u064E\u0635\u0651\u064E\u0644\u064E\u0670\u062A\u0656 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0645\u0651\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 134, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0648\u064E\u0642\u064E\u0639\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0631\u0651\u0650\u062C\u06E1\u0632\u064F \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u062F\u06E1\u0639\u064F \u0644\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0647\u0650\u062F\u064E \u0639\u0650\u0646\u062F\u064E\u0643\u064E\u06D6 \u0644\u064E\u0626\u0650\u0646 \u0643\u064E\u0634\u064E\u0641\u06E1\u062A\u064E \u0639\u064E\u0646\u0651\u064E\u0627 \u0671\u0644\u0631\u0651\u0650\u062C\u06E1\u0632\u064E \u0644\u064E\u0646\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0646\u0651\u064E \u0644\u064E\u0643\u064E \u0648\u064E\u0644\u064E\u0646\u064F\u0631\u06E1\u0633\u0650\u0644\u064E\u0646\u0651\u064E \u0645\u064E\u0639\u064E\u0643\u064E \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E" }, { id: 135, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0634\u064E\u0641\u06E1\u0646\u064E\u0627 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u0650\u062C\u06E1\u0632\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u064D \u0647\u064F\u0645 \u0628\u064E\u0670\u0644\u0650\u063A\u064F\u0648\u0647\u064F \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u0643\u064F\u062B\u064F\u0648\u0646\u064E" }, { id: 136, text: "\u0641\u064E\u0671\u0646\u062A\u064E\u0642\u064E\u0645\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u064A\u064E\u0645\u0651\u0650 \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u063A\u064E\u0670\u0641\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 137, text: "\u0648\u064E\u0623\u064E\u0648\u06E1\u0631\u064E\u062B\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0633\u06E1\u062A\u064E\u0636\u06E1\u0639\u064E\u0641\u064F\u0648\u0646\u064E \u0645\u064E\u0634\u064E\u0670\u0631\u0650\u0642\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u063A\u064E\u0670\u0631\u0650\u0628\u064E\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0628\u064E\u0670\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0648\u064E\u062A\u064E\u0645\u0651\u064E\u062A\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0628\u0650\u0645\u064E\u0627 \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u062F\u064E\u0645\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0635\u06E1\u0646\u064E\u0639\u064F \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064F\u0647\u064F\u06E5 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0631\u0650\u0634\u064F\u0648\u0646\u064E" }, { id: 138, text: "\u0648\u064E\u062C\u064E\u0670\u0648\u064E\u0632\u06E1\u0646\u064E\u0627 \u0628\u0650\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E \u0641\u064E\u0623\u064E\u062A\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0643\u064F\u0641\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0635\u06E1\u0646\u064E\u0627\u0645\u0656 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u0657\u0627 \u0643\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u065E\u06DA \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u062A\u064E\u062C\u06E1\u0647\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 139, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0645\u064F\u062A\u064E\u0628\u0651\u064E\u0631\u065E \u0645\u0651\u064E\u0627 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0628\u064E\u0670\u0637\u0650\u0644\u065E \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 140, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0628\u06E1\u063A\u0650\u064A\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u0657\u0627 \u0648\u064E\u0647\u064F\u0648\u064E \u0641\u064E\u0636\u0651\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 141, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u0644\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u064A\u064E\u0633\u064F\u0648\u0645\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u064A\u064F\u0642\u064E\u062A\u0651\u0650\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062D\u06E1\u064A\u064F\u0648\u0646\u064E \u0646\u0650\u0633\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645 \u0628\u064E\u0644\u064E\u0627\u0653\u0621\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 142, text: "\u06DE\u0648\u064E\u0648\u064E\u0670\u0639\u064E\u062F\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u062B\u064E\u0644\u064E\u0670\u062B\u0650\u064A\u0646\u064E \u0644\u064E\u064A\u06E1\u0644\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u062A\u06E1\u0645\u064E\u0645\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0628\u0650\u0639\u064E\u0634\u06E1\u0631\u0656 \u0641\u064E\u062A\u064E\u0645\u0651\u064E \u0645\u0650\u064A\u0642\u064E\u0670\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u0650\u064A\u0646\u064E \u0644\u064E\u064A\u06E1\u0644\u064E\u0629\u0657\u06DA \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0671\u062E\u06E1\u0644\u064F\u0641\u06E1\u0646\u0650\u064A \u0641\u0650\u064A \u0642\u064E\u0648\u06E1\u0645\u0650\u064A \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u0650\u062D\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0633\u064E\u0628\u0650\u064A\u0644\u064E \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 143, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0645\u0650\u064A\u0642\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0643\u064E\u0644\u0651\u064E\u0645\u064E\u0647\u064F\u06E5 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u06E5 \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0623\u064E\u0631\u0650\u0646\u0650\u064A\u0653 \u0623\u064E\u0646\u0638\u064F\u0631\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06DA \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0646 \u062A\u064E\u0631\u064E\u0649\u0670\u0646\u0650\u064A \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0650 \u0671\u0646\u0638\u064F\u0631\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062C\u064E\u0628\u064E\u0644\u0650 \u0641\u064E\u0625\u0650\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u064E \u0645\u064E\u0643\u064E\u0627\u0646\u064E\u0647\u064F\u06E5 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0631\u064E\u0649\u0670\u0646\u0650\u064A\u06DA \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u062C\u064E\u0644\u0651\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u06E5 \u0644\u0650\u0644\u06E1\u062C\u064E\u0628\u064E\u0644\u0650 \u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u06E5 \u062F\u064E\u0643\u0651\u0657\u0627 \u0648\u064E\u062E\u064E\u0631\u0651\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0635\u064E\u0639\u0650\u0642\u0657\u0627\u06DA \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0641\u064E\u0627\u0642\u064E \u0642\u064E\u0627\u0644\u064E \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0643\u064E \u062A\u064F\u0628\u06E1\u062A\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0623\u064E\u0648\u0651\u064E\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 144, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u0650\u064A \u0671\u0635\u06E1\u0637\u064E\u0641\u064E\u064A\u06E1\u062A\u064F\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u0650\u0631\u0650\u0633\u064E\u0670\u0644\u064E\u0670\u062A\u0650\u064A \u0648\u064E\u0628\u0650\u0643\u064E\u0644\u064E\u0670\u0645\u0650\u064A \u0641\u064E\u062E\u064F\u0630\u06E1 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0643\u064E \u0648\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 145, text: "\u0648\u064E\u0643\u064E\u062A\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0648\u064E\u0627\u062D\u0650 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u064E\u0648\u06E1\u0639\u0650\u0638\u064E\u0629\u0657 \u0648\u064E\u062A\u064E\u0641\u06E1\u0635\u0650\u064A\u0644\u0657\u0627 \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u062E\u064F\u0630\u06E1\u0647\u064E\u0627 \u0628\u0650\u0642\u064F\u0648\u0651\u064E\u0629\u0656 \u0648\u064E\u0623\u06E1\u0645\u064F\u0631\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064E\u0643\u064E \u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u0650\u0647\u064E\u0627\u06DA \u0633\u064E\u0623\u064F\u0648\u0652\u0631\u0650\u064A\u0643\u064F\u0645\u06E1 \u062F\u064E\u0627\u0631\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 146, text: "\u0633\u064E\u0623\u064E\u0635\u06E1\u0631\u0650\u0641\u064F \u0639\u064E\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u064E\u0643\u064E\u0628\u0651\u064E\u0631\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0643\u064F\u0644\u0651\u064E \u0621\u064E\u0627\u064A\u064E\u0629\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0633\u064E\u0628\u0650\u064A\u0644\u064E \u0671\u0644\u0631\u0651\u064F\u0634\u06E1\u062F\u0650 \u0644\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0647\u064F \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0633\u064E\u0628\u0650\u064A\u0644\u064E \u0671\u0644\u06E1\u063A\u064E\u064A\u0651\u0650 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0647\u064F \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u063A\u064E\u0670\u0641\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 147, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0644\u0650\u0642\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u062D\u064E\u0628\u0650\u0637\u064E\u062A\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1\u06DA \u0647\u064E\u0644\u06E1 \u064A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 148, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0642\u064E\u0648\u06E1\u0645\u064F \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u062D\u064F\u0644\u0650\u064A\u0651\u0650\u0647\u0650\u0645\u06E1 \u0639\u0650\u062C\u06E1\u0644\u0657\u0627 \u062C\u064E\u0633\u064E\u062F\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u06E5 \u062E\u064F\u0648\u064E\u0627\u0631\u064C\u06DA \u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0633\u064E\u0628\u0650\u064A\u0644\u064B\u0627\u06D8 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0647\u064F \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0638\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 149, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0633\u064F\u0642\u0650\u0637\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0631\u064E\u0623\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0626\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062D\u064E\u0645\u06E1\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0648\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0644\u064E\u0646\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 150, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u062C\u064E\u0639\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u063A\u064E\u0636\u06E1\u0628\u064E\u0670\u0646\u064E \u0623\u064E\u0633\u0650\u0641\u0657\u0627 \u0642\u064E\u0627\u0644\u064E \u0628\u0650\u0626\u06E1\u0633\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0641\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u0650\u064A \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u064A\u0653\u06D6 \u0623\u064E\u0639\u064E\u062C\u0650\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0631\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0648\u064E\u0627\u062D\u064E \u0648\u064E\u0623\u064E\u062E\u064E\u0630\u064E \u0628\u0650\u0631\u064E\u0623\u06E1\u0633\u0650 \u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u064A\u064E\u062C\u064F\u0631\u0651\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0642\u064E\u0627\u0644\u064E \u0671\u0628\u06E1\u0646\u064E \u0623\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0633\u06E1\u062A\u064E\u0636\u06E1\u0639\u064E\u0641\u064F\u0648\u0646\u0650\u064A \u0648\u064E\u0643\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E\u0646\u0650\u064A \u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0634\u06E1\u0645\u0650\u062A\u06E1 \u0628\u0650\u064A\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u062F\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u0650\u064A \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 151, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u0650\u064A \u0648\u064E\u0644\u0650\u0623\u064E\u062E\u0650\u064A \u0648\u064E\u0623\u064E\u062F\u06E1\u062E\u0650\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0643\u064E\u06D6 \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u0623\u064E\u0631\u06E1\u062D\u064E\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u062D\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 152, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u062C\u06E1\u0644\u064E \u0633\u064E\u064A\u064E\u0646\u064E\u0627\u0644\u064F\u0647\u064F\u0645\u06E1 \u063A\u064E\u0636\u064E\u0628\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0630\u0650\u0644\u0651\u064E\u0629\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u062A\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 153, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u064E\u0627 \u0648\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u064E\u0627 \u0644\u064E\u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 154, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0633\u064E\u0643\u064E\u062A\u064E \u0639\u064E\u0646 \u0645\u0651\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u063A\u064E\u0636\u064E\u0628\u064F \u0623\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0648\u064E\u0627\u062D\u064E\u06D6 \u0648\u064E\u0641\u0650\u064A \u0646\u064F\u0633\u06E1\u062E\u064E\u062A\u0650\u0647\u064E\u0627 \u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0631\u06E1\u0647\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 155, text: "\u0648\u064E\u0671\u062E\u06E1\u062A\u064E\u0627\u0631\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u06E5 \u0633\u064E\u0628\u06E1\u0639\u0650\u064A\u0646\u064E \u0631\u064E\u062C\u064F\u0644\u0657\u0627 \u0644\u0651\u0650\u0645\u0650\u064A\u0642\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u062C\u06E1\u0641\u064E\u0629\u064F \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0644\u064E\u0648\u06E1 \u0634\u0650\u0626\u06E1\u062A\u064E \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u062A\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0625\u0650\u064A\u0651\u064E\u0640\u0670\u064A\u064E\u06D6 \u0623\u064E\u062A\u064F\u0647\u06E1\u0644\u0650\u0643\u064F\u0646\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0633\u0651\u064F\u0641\u064E\u0647\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u0651\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u06E1 \u0647\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u062A\u06E1\u0646\u064E\u062A\u064F\u0643\u064E \u062A\u064F\u0636\u0650\u0644\u0651\u064F \u0628\u0650\u0647\u064E\u0627 \u0645\u064E\u0646 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u062A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0623\u064E\u0646\u062A\u064E \u0648\u064E\u0644\u0650\u064A\u0651\u064F\u0646\u064E\u0627 \u0641\u064E\u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u0631\u06E1\u062D\u064E\u0645\u06E1\u0646\u064E\u0627\u06D6 \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 156, text: "\u06DE\u0648\u064E\u0671\u0643\u06E1\u062A\u064F\u0628\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0657 \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0625\u0650\u0646\u0651\u064E\u0627 \u0647\u064F\u062F\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06DA \u0642\u064E\u0627\u0644\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u0650\u064A\u0653 \u0623\u064F\u0635\u0650\u064A\u0628\u064F \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u064A \u0648\u064E\u0633\u0650\u0639\u064E\u062A\u06E1 \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0641\u064E\u0633\u064E\u0623\u064E\u0643\u06E1\u062A\u064F\u0628\u064F\u0647\u064E\u0627 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E \u0648\u064E\u064A\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 157, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064E \u0671\u0644\u06E1\u0623\u064F\u0645\u0651\u0650\u064A\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0645\u064E\u0643\u06E1\u062A\u064F\u0648\u0628\u064B\u0627 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u0650 \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0648\u064E\u064A\u064E\u0646\u06E1\u0647\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650 \u0648\u064E\u064A\u064F\u062D\u0650\u0644\u0651\u064F \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0648\u064E\u064A\u064F\u062D\u064E\u0631\u0651\u0650\u0645\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u064E\u0640\u0670\u0653\u0626\u0650\u062B\u064E \u0648\u064E\u064A\u064E\u0636\u064E\u0639\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0625\u0650\u0635\u06E1\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u063A\u06E1\u0644\u064E\u0670\u0644\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0641\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0639\u064E\u0632\u0651\u064E\u0631\u064F\u0648\u0647\u064F \u0648\u064E\u0646\u064E\u0635\u064E\u0631\u064F\u0648\u0647\u064F \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064F\u0648\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 158, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0625\u0650\u0646\u0651\u0650\u064A \u0631\u064E\u0633\u064F\u0648\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u064A\u064F\u0645\u0650\u064A\u062A\u064F\u06D6 \u0641\u064E\u0640\u0654\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650 \u0671\u0644\u06E1\u0623\u064F\u0645\u0651\u0650\u064A\u0651\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0647\u064F \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 159, text: "\u0648\u064E\u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u0651\u064E\u0629\u065E \u064A\u064E\u0647\u06E1\u062F\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 160, text: "\u0648\u064E\u0642\u064E\u0637\u0651\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u062B\u06E1\u0646\u064E\u062A\u064E\u064A\u06E1 \u0639\u064E\u0634\u06E1\u0631\u064E\u0629\u064E \u0623\u064E\u0633\u06E1\u0628\u064E\u0627\u0637\u064B\u0627 \u0623\u064F\u0645\u064E\u0645\u0657\u0627\u06DA \u0648\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u0650 \u0671\u0633\u06E1\u062A\u064E\u0633\u06E1\u0642\u064E\u0649\u0670\u0647\u064F \u0642\u064E\u0648\u06E1\u0645\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646\u0650 \u0671\u0636\u06E1\u0631\u0650\u0628 \u0628\u0651\u0650\u0639\u064E\u0635\u064E\u0627\u0643\u064E \u0671\u0644\u06E1\u062D\u064E\u062C\u064E\u0631\u064E\u06D6 \u0641\u064E\u0671\u0646\u06E2\u0628\u064E\u062C\u064E\u0633\u064E\u062A\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064F \u0671\u062B\u06E1\u0646\u064E\u062A\u064E\u0627 \u0639\u064E\u0634\u06E1\u0631\u064E\u0629\u064E \u0639\u064E\u064A\u06E1\u0646\u0657\u0627\u06D6 \u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u064E \u0643\u064F\u0644\u0651\u064F \u0623\u064F\u0646\u064E\u0627\u0633\u0656 \u0645\u0651\u064E\u0634\u06E1\u0631\u064E\u0628\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0638\u064E\u0644\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0645\u064E\u0670\u0645\u064E \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0646\u0651\u064E \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0644\u06E1\u0648\u064E\u0649\u0670\u06D6 \u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0645\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 161, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0633\u06E1\u0643\u064F\u0646\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064E \u0648\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062D\u064E\u064A\u06E1\u062B\u064F \u0634\u0650\u0626\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u062D\u0650\u0637\u0651\u064E\u0629\u065E \u0648\u064E\u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0628\u064E\u0627\u0628\u064E \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627 \u0646\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u062E\u064E\u0637\u0650\u064A\u0653\u0640\u0654\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1\u06DA \u0633\u064E\u0646\u064E\u0632\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 162, text: "\u0641\u064E\u0628\u064E\u062F\u0651\u064E\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0644\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0631\u0650\u062C\u06E1\u0632\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 163, text: "\u0648\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u06E1\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u062D\u064E\u0627\u0636\u0650\u0631\u064E\u0629\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0625\u0650\u0630\u06E1 \u064A\u064E\u0639\u06E1\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0628\u06E1\u062A\u0650 \u0625\u0650\u0630\u06E1 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645\u06E1 \u062D\u0650\u064A\u062A\u064E\u0627\u0646\u064F\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0633\u064E\u0628\u06E1\u062A\u0650\u0647\u0650\u0645\u06E1 \u0634\u064F\u0631\u0651\u064E\u0639\u0657\u0627 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0628\u0650\u062A\u064F\u0648\u0646\u064E \u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645\u06E1\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u0628\u06E1\u0644\u064F\u0648\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0633\u064F\u0642\u064F\u0648\u0646\u064E" }, { id: 164, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u0650\u0645\u064E \u062A\u064E\u0639\u0650\u0638\u064F\u0648\u0646\u064E \u0642\u064E\u0648\u06E1\u0645\u064B\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064F\u0647\u06E1\u0644\u0650\u0643\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0645\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u06E1\u0630\u0650\u0631\u064E\u0629\u064B \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 165, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0646\u064E\u0633\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0630\u064F\u0643\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0646\u06E1\u0647\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u0650 \u0648\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u0650\u06ED \u0628\u064E\u0640\u0654\u0650\u064A\u0633\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0633\u064F\u0642\u064F\u0648\u0646\u064E" }, { id: 166, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0639\u064E\u062A\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0646 \u0645\u0651\u064E\u0627 \u0646\u064F\u0647\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F \u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0642\u0650\u0631\u064E\u062F\u064E\u0629\u064B \u062E\u064E\u0670\u0633\u0650\u0640\u0654\u0650\u064A\u0646\u064E" }, { id: 167, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u062A\u064E\u0623\u064E\u0630\u0651\u064E\u0646\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0644\u064E\u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064E\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0645\u064E\u0646 \u064A\u064E\u0633\u064F\u0648\u0645\u064F\u0647\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650\u06D7 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0633\u064E\u0631\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 168, text: "\u0648\u064E\u0642\u064E\u0637\u0651\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064F\u0645\u064E\u0645\u0657\u0627\u06D6 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062F\u064F\u0648\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0648\u064E\u0628\u064E\u0644\u064E\u0648\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 169, text: "\u0641\u064E\u062E\u064E\u0644\u064E\u0641\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u062E\u064E\u0644\u06E1\u0641\u065E \u0648\u064E\u0631\u0650\u062B\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0646\u064E \u0639\u064E\u0631\u064E\u0636\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0633\u064E\u064A\u064F\u063A\u06E1\u0641\u064E\u0631\u064F \u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u0647\u0650\u0645\u06E1 \u0639\u064E\u0631\u064E\u0636\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0647\u064F\u06E5 \u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0647\u064F\u06DA \u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0624\u06E1\u062E\u064E\u0630\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u064A\u062B\u064E\u0670\u0642\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0623\u064E\u0646 \u0644\u0651\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0648\u064E\u062F\u064E\u0631\u064E\u0633\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0641\u0650\u064A\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u062F\u0651\u064E\u0627\u0631\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064F \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 170, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0645\u064E\u0633\u0651\u0650\u0643\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0627 \u0646\u064F\u0636\u0650\u064A\u0639\u064F \u0623\u064E\u062C\u06E1\u0631\u064E \u0671\u0644\u06E1\u0645\u064F\u0635\u06E1\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 171, text: "\u06DE\u0648\u064E\u0625\u0650\u0630\u06E1 \u0646\u064E\u062A\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u062C\u064E\u0628\u064E\u0644\u064E \u0641\u064E\u0648\u06E1\u0642\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0638\u064F\u0644\u0651\u064E\u0629\u065E \u0648\u064E\u0638\u064E\u0646\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0627\u0642\u0650\u0639\u064F\u06E2 \u0628\u0650\u0647\u0650\u0645\u06E1 \u062E\u064F\u0630\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0628\u0650\u0642\u064F\u0648\u0651\u064E\u0629\u0656 \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0641\u0650\u064A\u0647\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 172, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u062E\u064E\u0630\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0646\u0650\u064A\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0645\u0650\u0646 \u0638\u064F\u0647\u064F\u0648\u0631\u0650\u0647\u0650\u0645\u06E1 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0634\u06E1\u0647\u064E\u062F\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0644\u064E\u0633\u06E1\u062A\u064F \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u0647\u0650\u062F\u06E1\u0646\u064E\u0627\u0653\u06DA \u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0639\u064E\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u063A\u064E\u0670\u0641\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 173, text: "\u0623\u064E\u0648\u06E1 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064E \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0623\u064E\u0641\u064E\u062A\u064F\u0647\u06E1\u0644\u0650\u0643\u064F\u0646\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u06E1\u0645\u064F\u0628\u06E1\u0637\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 174, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u0641\u064E\u0635\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 175, text: "\u0648\u064E\u0671\u062A\u06E1\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0646\u064E\u0628\u064E\u0623\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0671\u0646\u0633\u064E\u0644\u064E\u062E\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0641\u064E\u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u064E\u0647\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0641\u064E\u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0627\u0648\u0650\u064A\u0646\u064E" }, { id: 176, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u0650\u0626\u06E1\u0646\u064E\u0627 \u0644\u064E\u0631\u064E\u0641\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062E\u06E1\u0644\u064E\u062F\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0647\u064E\u0648\u064E\u0649\u0670\u0647\u064F\u06DA \u0641\u064E\u0645\u064E\u062B\u064E\u0644\u064F\u0647\u064F\u06E5 \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u0671\u0644\u06E1\u0643\u064E\u0644\u06E1\u0628\u0650 \u0625\u0650\u0646 \u062A\u064E\u062D\u06E1\u0645\u0650\u0644\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064E\u0644\u06E1\u0647\u064E\u062B\u06E1 \u0623\u064E\u0648\u06E1 \u062A\u064E\u062A\u06E1\u0631\u064F\u0643\u06E1\u0647\u064F \u064A\u064E\u0644\u06E1\u0647\u064E\u062B\u06DA \u0630\u0651\u064E\u0640\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u06DA \u0641\u064E\u0671\u0642\u06E1\u0635\u064F\u0635\u0650 \u0671\u0644\u06E1\u0642\u064E\u0635\u064E\u0635\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 177, text: "\u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u062B\u064E\u0644\u064B\u0627 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 178, text: "\u0645\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u06E1 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 179, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0630\u064E\u0631\u064E\u0623\u06E1\u0646\u064E\u0627 \u0644\u0650\u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650\u06D6 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u065E \u0644\u0651\u064E\u0627 \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627\u0653\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0643\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064F\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0641\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 180, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670 \u0641\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0647\u064F \u0628\u0650\u0647\u064E\u0627\u06D6 \u0648\u064E\u0630\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0644\u06E1\u062D\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0633\u06E1\u0645\u064E\u0640\u0670\u0653\u0626\u0650\u0647\u0650\u06E6\u06DA \u0633\u064E\u064A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 181, text: "\u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627\u0653 \u0623\u064F\u0645\u0651\u064E\u0629\u065E \u064A\u064E\u0647\u06E1\u062F\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 182, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0633\u064E\u0646\u064E\u0633\u06E1\u062A\u064E\u062F\u06E1\u0631\u0650\u062C\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 183, text: "\u0648\u064E\u0623\u064F\u0645\u06E1\u0644\u0650\u064A \u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0643\u064E\u064A\u06E1\u062F\u0650\u064A \u0645\u064E\u062A\u0650\u064A\u0646\u064C" }, { id: 184, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0627\u0652\u06D7 \u0645\u064E\u0627 \u0628\u0650\u0635\u064E\u0627\u062D\u0650\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u062C\u0650\u0646\u0651\u064E\u0629\u064D\u06DA \u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 185, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0645\u064E\u0644\u064E\u0643\u064F\u0648\u062A\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0623\u064E\u0646\u06E1 \u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0642\u064E\u062F\u0650 \u0671\u0642\u06E1\u062A\u064E\u0631\u064E\u0628\u064E \u0623\u064E\u062C\u064E\u0644\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u062D\u064E\u062F\u0650\u064A\u062B\u0650\u06ED \u0628\u064E\u0639\u06E1\u062F\u064E\u0647\u064F\u06E5 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 186, text: "\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0644\u064E\u0627 \u0647\u064E\u0627\u062F\u0650\u064A\u064E \u0644\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u064A\u064E\u0630\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0637\u064F\u063A\u06E1\u064A\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0645\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 187, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0646\u064E \u0645\u064F\u0631\u06E1\u0633\u064E\u0649\u0670\u0647\u064E\u0627\u06D6 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0639\u0650\u0644\u06E1\u0645\u064F\u0647\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u064A\u06D6 \u0644\u064E\u0627 \u064A\u064F\u062C\u064E\u0644\u0651\u0650\u064A\u0647\u064E\u0627 \u0644\u0650\u0648\u064E\u0642\u06E1\u062A\u0650\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06DA \u062B\u064E\u0642\u064F\u0644\u064E\u062A\u06E1 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657\u06D7 \u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0643\u064E \u062D\u064E\u0641\u0650\u064A\u0651\u064C \u0639\u064E\u0646\u06E1\u0647\u064E\u0627\u06D6 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0639\u0650\u0644\u06E1\u0645\u064F\u0647\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 188, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u064A \u0646\u064E\u0641\u06E1\u0639\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0636\u064E\u0631\u0651\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064F\u0646\u062A\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u064E \u0644\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u062B\u064E\u0631\u06E1\u062A\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650 \u0648\u064E\u0645\u064E\u0627 \u0645\u064E\u0633\u0651\u064E\u0646\u0650\u064A\u064E \u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u064F\u06DA \u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0648\u064E\u0628\u064E\u0634\u0650\u064A\u0631\u065E \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 189, text: "\u06DE\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0656 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0656 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0632\u064E\u0648\u06E1\u062C\u064E\u0647\u064E\u0627 \u0644\u0650\u064A\u064E\u0633\u06E1\u0643\u064F\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u063A\u064E\u0634\u0651\u064E\u0649\u0670\u0647\u064E\u0627 \u062D\u064E\u0645\u064E\u0644\u064E\u062A\u06E1 \u062D\u064E\u0645\u06E1\u0644\u064B\u0627 \u062E\u064E\u0641\u0650\u064A\u0641\u0657\u0627 \u0641\u064E\u0645\u064E\u0631\u0651\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062B\u06E1\u0642\u064E\u0644\u064E\u062A \u062F\u0651\u064E\u0639\u064E\u0648\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645\u064E\u0627 \u0644\u064E\u0626\u0650\u0646\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064E\u0646\u064E\u0627 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0644\u0651\u064E\u0646\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 190, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064E\u0627 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u062C\u064E\u0639\u064E\u0644\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E \u0641\u0650\u064A\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064E\u0627\u06DA \u0641\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 191, text: "\u0623\u064E\u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u062E\u06E1\u0644\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 192, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0635\u06E1\u0631\u0657\u0627 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 193, text: "\u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0644\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0643\u064F\u0645\u06E1\u06DA \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u062F\u064E\u0639\u064E\u0648\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u0645\u0650\u062A\u064F\u0648\u0646\u064E" }, { id: 194, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u0650\u0628\u064E\u0627\u062F\u064C \u0623\u064E\u0645\u06E1\u062B\u064E\u0627\u0644\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u06E1\u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 195, text: "\u0623\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u065E \u064A\u064E\u0645\u06E1\u0634\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627\u0653\u06D6 \u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0656 \u064A\u064E\u0628\u06E1\u0637\u0650\u0634\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627\u0653\u06D6 \u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u065E \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627\u0653\u06D6 \u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u065E \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627\u06D7 \u0642\u064F\u0644\u0650 \u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0643\u0650\u064A\u062F\u064F\u0648\u0646\u0650 \u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0646\u0638\u0650\u0631\u064F\u0648\u0646\u0650" }, { id: 196, text: "\u0625\u0650\u0646\u0651\u064E \u0648\u064E\u0644\u0650\u0640\u06E7\u0651\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 197, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0646\u064E\u0635\u06E1\u0631\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 198, text: "\u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 199, text: "\u062E\u064F\u0630\u0650 \u0671\u0644\u06E1\u0639\u064E\u0641\u06E1\u0648\u064E \u0648\u064E\u0623\u06E1\u0645\u064F\u0631\u06E1 \u0628\u0650\u0671\u0644\u06E1\u0639\u064F\u0631\u06E1\u0641\u0650 \u0648\u064E\u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 200, text: "\u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0646\u0632\u064E\u063A\u064E\u0646\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0646\u064E\u0632\u06E1\u063A\u065E \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0639\u0650\u0630\u06E1 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 201, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E\u0647\u064F\u0645\u06E1 \u0637\u064E\u0640\u0670\u0653\u0626\u0650\u0641\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 202, text: "\u0648\u064E\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u064F\u0647\u064F\u0645\u06E1 \u064A\u064E\u0645\u064F\u062F\u0651\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u063A\u064E\u064A\u0651\u0650 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064F\u0642\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 203, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0623\u06E1\u062A\u0650\u0647\u0650\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u0656 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0671\u062C\u06E1\u062A\u064E\u0628\u064E\u064A\u06E1\u062A\u064E\u0647\u064E\u0627\u06DA \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u064A\u06DA \u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u064E\u0635\u064E\u0627\u0653\u0626\u0650\u0631\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 204, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064F\u0631\u0650\u0626\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064F \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0623\u064E\u0646\u0635\u0650\u062A\u064F\u0648\u0627\u0652 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0631\u06E1\u062D\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 205, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631 \u0631\u0651\u064E\u0628\u0651\u064E\u0643\u064E \u0641\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u0650\u0643\u064E \u062A\u064E\u0636\u064E\u0631\u0651\u064F\u0639\u0657\u0627 \u0648\u064E\u062E\u0650\u064A\u0641\u064E\u0629\u0657 \u0648\u064E\u062F\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0647\u06E1\u0631\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u0628\u0650\u0671\u0644\u06E1\u063A\u064F\u062F\u064F\u0648\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u0635\u064E\u0627\u0644\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0670\u0641\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 206, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0647\u064F\u06E5 \u064A\u064E\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0646\u064E\u06E4\u06E9" }] }, { id: 8, name: "\u0627\u0644\u0623\u0646\u0641\u0627\u0644", transliteration: "Al-Anfal", type: "medinan", total_verses: 75, verses: [{ id: 1, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0623\u064E\u0646\u0641\u064E\u0627\u0644\u0650\u06D6 \u0642\u064F\u0644\u0650 \u0671\u0644\u06E1\u0623\u064E\u0646\u0641\u064E\u0627\u0644\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650\u06D6 \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u0650\u062D\u064F\u0648\u0627\u0652 \u0630\u064E\u0627\u062A\u064E \u0628\u064E\u064A\u06E1\u0646\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 2, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627 \u0630\u064F\u0643\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u062C\u0650\u0644\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u0644\u0650\u064A\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0647\u064F\u06E5 \u0632\u064E\u0627\u062F\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0642\u0650\u064A\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u062D\u064E\u0642\u0651\u0657\u0627\u06DA \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u064C \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0631\u0650\u0632\u06E1\u0642\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u065E" }, { id: 5, text: "\u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E\u0643\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u062A\u0650\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0644\u064E\u0643\u064E\u0670\u0631\u0650\u0647\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0627 \u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0633\u064E\u0627\u0642\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u064A\u064E\u0639\u0650\u062F\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u062D\u06E1\u062F\u064E\u0649 \u0671\u0644\u0637\u0651\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u0646\u0651\u064E\u0647\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u062A\u064E\u0648\u064E\u062F\u0651\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E \u063A\u064E\u064A\u06E1\u0631\u064E \u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0634\u0651\u064E\u0648\u06E1\u0643\u064E\u0629\u0650 \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064F\u062D\u0650\u0642\u0651\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0628\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0642\u06E1\u0637\u064E\u0639\u064E \u062F\u064E\u0627\u0628\u0650\u0631\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u0644\u0650\u064A\u064F\u062D\u0650\u0642\u0651\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0648\u064E\u064A\u064F\u0628\u06E1\u0637\u0650\u0644\u064E \u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u064E \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0631\u0650\u0647\u064E \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0625\u0650\u0630\u06E1 \u062A\u064E\u0633\u06E1\u062A\u064E\u063A\u0650\u064A\u062B\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0627\u0628\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u0650\u064A \u0645\u064F\u0645\u0650\u062F\u0651\u064F\u0643\u064F\u0645 \u0628\u0650\u0623\u064E\u0644\u06E1\u0641\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0645\u064F\u0631\u06E1\u062F\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0648\u064E\u0644\u0650\u062A\u064E\u0637\u06E1\u0645\u064E\u0626\u0650\u0646\u0651\u064E \u0628\u0650\u0647\u0650\u06E6 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0635\u06E1\u0631\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u064C" }, { id: 11, text: "\u0625\u0650\u0630\u06E1 \u064A\u064F\u063A\u064E\u0634\u0651\u0650\u064A\u0643\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064F\u0639\u064E\u0627\u0633\u064E \u0623\u064E\u0645\u064E\u0646\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0644\u0651\u0650\u064A\u064F\u0637\u064E\u0647\u0651\u0650\u0631\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0630\u06E1\u0647\u0650\u0628\u064E \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0631\u0650\u062C\u06E1\u0632\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0648\u064E\u0644\u0650\u064A\u064E\u0631\u06E1\u0628\u0650\u0637\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u062B\u064E\u0628\u0651\u0650\u062A\u064E \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u062F\u064E\u0627\u0645\u064E" }, { id: 12, text: "\u0625\u0650\u0630\u06E1 \u064A\u064F\u0648\u062D\u0650\u064A \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0623\u064E\u0646\u0651\u0650\u064A \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u062B\u064E\u0628\u0651\u0650\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652\u06DA \u0633\u064E\u0623\u064F\u0644\u06E1\u0642\u0650\u064A \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064F\u0639\u06E1\u0628\u064E \u0641\u064E\u0671\u0636\u06E1\u0631\u0650\u0628\u064F\u0648\u0627\u0652 \u0641\u064E\u0648\u06E1\u0642\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0646\u064E\u0627\u0642\u0650 \u0648\u064E\u0671\u0636\u06E1\u0631\u0650\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0643\u064F\u0644\u0651\u064E \u0628\u064E\u0646\u064E\u0627\u0646\u0656" }, { id: 13, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0634\u064E\u0627\u0653\u0642\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0634\u064E\u0627\u0642\u0650\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 14, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0647\u064F \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 15, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0644\u064E\u0642\u0650\u064A\u062A\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0632\u064E\u062D\u06E1\u0641\u0657\u0627 \u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0648\u064E\u0644\u0651\u064F\u0648\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u062F\u06E1\u0628\u064E\u0627\u0631\u064E" }, { id: 16, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0648\u064E\u0644\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u062F\u064F\u0628\u064F\u0631\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064F\u062A\u064E\u062D\u064E\u0631\u0651\u0650\u0641\u0657\u0627 \u0644\u0651\u0650\u0642\u0650\u062A\u064E\u0627\u0644\u064D \u0623\u064E\u0648\u06E1 \u0645\u064F\u062A\u064E\u062D\u064E\u064A\u0651\u0650\u0632\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0626\u064E\u0629\u0656 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0628\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u063A\u064E\u0636\u064E\u0628\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 17, text: "\u0641\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u062A\u064E\u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u0631\u064E\u0645\u064E\u064A\u06E1\u062A\u064E \u0625\u0650\u0630\u06E1 \u0631\u064E\u0645\u064E\u064A\u06E1\u062A\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0645\u064E\u0649\u0670 \u0648\u064E\u0644\u0650\u064A\u064F\u0628\u06E1\u0644\u0650\u064A\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0628\u064E\u0644\u064E\u0627\u0653\u0621\u064B \u062D\u064E\u0633\u064E\u0646\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 18, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u0648\u0647\u0650\u0646\u064F \u0643\u064E\u064A\u06E1\u062F\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 19, text: "\u0625\u0650\u0646 \u062A\u064E\u0633\u06E1\u062A\u064E\u0641\u06E1\u062A\u0650\u062D\u064F\u0648\u0627\u0652 \u0641\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u062A\u06E1\u062D\u064F\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0646\u062A\u064E\u0647\u064F\u0648\u0627\u0652 \u0641\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0639\u064F\u0648\u062F\u064F\u0648\u0627\u0652 \u0646\u064E\u0639\u064F\u062F\u06E1 \u0648\u064E\u0644\u064E\u0646 \u062A\u064F\u063A\u06E1\u0646\u0650\u064A\u064E \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0641\u0650\u0626\u064E\u062A\u064F\u0643\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u062B\u064F\u0631\u064E\u062A\u06E1 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 20, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0634\u064E\u0631\u0651\u064E \u0671\u0644\u062F\u0651\u064E\u0648\u064E\u0627\u0653\u0628\u0651\u0650 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0635\u0651\u064F\u0645\u0651\u064F \u0671\u0644\u06E1\u0628\u064F\u0643\u06E1\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0639\u064E\u0644\u0650\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0623\u064E\u0633\u06E1\u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0633\u06E1\u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0625\u0650\u0630\u064E\u0627 \u062F\u064E\u0639\u064E\u0627\u0643\u064F\u0645\u06E1 \u0644\u0650\u0645\u064E\u0627 \u064A\u064F\u062D\u06E1\u064A\u0650\u064A\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062D\u064F\u0648\u0644\u064F \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u0621\u0650 \u0648\u064E\u0642\u064E\u0644\u06E1\u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0657 \u0644\u0651\u064E\u0627 \u062A\u064F\u0635\u0650\u064A\u0628\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u062E\u064E\u0627\u0653\u0635\u0651\u064E\u0629\u0657\u06D6 \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 26, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0644\u0650\u064A\u0644\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0636\u06E1\u0639\u064E\u0641\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u062A\u064E\u062E\u064E\u0637\u0651\u064E\u0641\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0641\u064E\u0640\u0654\u064E\u0627\u0648\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u064A\u0651\u064E\u062F\u064E\u0643\u064F\u0645 \u0628\u0650\u0646\u064E\u0635\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0648\u064E\u0631\u064E\u0632\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062E\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0648\u064E\u062A\u064E\u062E\u064F\u0648\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u064E\u0670\u0646\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u065E \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062C\u06E1\u0631\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 29, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0641\u064F\u0631\u06E1\u0642\u064E\u0627\u0646\u0657\u0627 \u0648\u064E\u064A\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u06E1 \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0630\u064F\u0648 \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 30, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u064A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F \u0628\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u064A\u064F\u062B\u06E1\u0628\u0650\u062A\u064F\u0648\u0643\u064E \u0623\u064E\u0648\u06E1 \u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0643\u064E \u0623\u064E\u0648\u06E1 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0643\u064E\u06DA \u0648\u064E\u064A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E \u0648\u064E\u064A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u0645\u064E\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 31, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0642\u064E\u062F\u06E1 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0644\u064E\u0648\u06E1 \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0644\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u062B\u06E1\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u064E\u0670\u0637\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u0645\u0651\u064E \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0643\u064E \u0641\u064E\u0623\u064E\u0645\u06E1\u0637\u0650\u0631\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u062D\u0650\u062C\u064E\u0627\u0631\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u0648\u0650 \u0671\u0626\u06E1\u062A\u0650\u0646\u064E\u0627 \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 33, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u0641\u0650\u064A\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0644\u0651\u064E\u0627 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0635\u064E\u0644\u064E\u0627\u062A\u064F\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064F\u0643\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u062A\u064E\u0635\u06E1\u062F\u0650\u064A\u064E\u0629\u0657\u06DA \u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0641\u064E\u0633\u064E\u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062D\u064E\u0633\u06E1\u0631\u064E\u0629\u0657 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u063A\u06E1\u0644\u064E\u0628\u064F\u0648\u0646\u064E\u06D7 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u064A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0644\u0650\u064A\u064E\u0645\u0650\u064A\u0632\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u0650 \u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u064E \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u0641\u064E\u064A\u064E\u0631\u06E1\u0643\u064F\u0645\u064E\u0647\u064F\u06E5 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0641\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u064A\u064E\u0646\u062A\u064E\u0647\u064F\u0648\u0627\u0652 \u064A\u064F\u063A\u06E1\u0641\u064E\u0631\u06E1 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0642\u064E\u062F\u06E1 \u0633\u064E\u0644\u064E\u0641\u064E \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0639\u064F\u0648\u062F\u064F\u0648\u0627\u0652 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0645\u064E\u0636\u064E\u062A\u06E1 \u0633\u064F\u0646\u0651\u064E\u062A\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 39, text: "\u0648\u064E\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u065E \u0648\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064F \u0643\u064F\u0644\u0651\u064F\u0647\u064F\u06E5 \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0641\u064E\u0625\u0650\u0646\u0650 \u0671\u0646\u062A\u064E\u0647\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 40, text: "\u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06DA \u0646\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0648\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u0646\u0651\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 41, text: "\u06DE\u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u063A\u064E\u0646\u0650\u0645\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0623\u064E\u0646\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u062E\u064F\u0645\u064F\u0633\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u0650\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0648\u064E\u0644\u0650\u0630\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u0650 \u0648\u064E\u0671\u0628\u06E1\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u0628\u06E1\u062F\u0650\u0646\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0641\u064F\u0631\u06E1\u0642\u064E\u0627\u0646\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u062A\u064E\u0642\u064E\u0649 \u0671\u0644\u06E1\u062C\u064E\u0645\u06E1\u0639\u064E\u0627\u0646\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 42, text: "\u0625\u0650\u0630\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0639\u064F\u062F\u06E1\u0648\u064E\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0639\u064F\u062F\u06E1\u0648\u064E\u0629\u0650 \u0671\u0644\u06E1\u0642\u064F\u0635\u06E1\u0648\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0643\u06E1\u0628\u064F \u0623\u064E\u0633\u06E1\u0641\u064E\u0644\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u062A\u064E\u0648\u064E\u0627\u0639\u064E\u062F\u062A\u0651\u064F\u0645\u06E1 \u0644\u064E\u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u0650\u064A\u0639\u064E\u0670\u062F\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u0650\u064A\u064E\u0642\u06E1\u0636\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0645\u06E1\u0631\u0657\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u0641\u06E1\u0639\u064F\u0648\u0644\u0657\u0627 \u0644\u0651\u0650\u064A\u064E\u0647\u06E1\u0644\u0650\u0643\u064E \u0645\u064E\u0646\u06E1 \u0647\u064E\u0644\u064E\u0643\u064E \u0639\u064E\u0646\u06E2 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656 \u0648\u064E\u064A\u064E\u062D\u06E1\u064A\u064E\u0649\u0670 \u0645\u064E\u0646\u06E1 \u062D\u064E\u064A\u0651\u064E \u0639\u064E\u0646\u06E2 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 43, text: "\u0625\u0650\u0630\u06E1 \u064A\u064F\u0631\u0650\u064A\u0643\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A \u0645\u064E\u0646\u064E\u0627\u0645\u0650\u0643\u064E \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0631\u064E\u0649\u0670\u0643\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0644\u0651\u064E\u0641\u064E\u0634\u0650\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u062A\u064E\u0646\u064E\u0670\u0632\u064E\u0639\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0644\u0651\u064E\u0645\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 44, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u064A\u064F\u0631\u0650\u064A\u0643\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0630\u0650 \u0671\u0644\u06E1\u062A\u064E\u0642\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0650\u0643\u064F\u0645\u06E1 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0648\u064E\u064A\u064F\u0642\u064E\u0644\u0651\u0650\u0644\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0650\u0647\u0650\u0645\u06E1 \u0644\u0650\u064A\u064E\u0642\u06E1\u0636\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0645\u06E1\u0631\u0657\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u0641\u06E1\u0639\u064F\u0648\u0644\u0657\u0627\u06D7 \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u064F" }, { id: 45, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0644\u064E\u0642\u0650\u064A\u062A\u064F\u0645\u06E1 \u0641\u0650\u0626\u064E\u0629\u0657 \u0641\u064E\u0671\u062B\u06E1\u0628\u064F\u062A\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u064E\u0670\u0632\u064E\u0639\u064F\u0648\u0627\u0652 \u0641\u064E\u062A\u064E\u0641\u06E1\u0634\u064E\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u0630\u06E1\u0647\u064E\u0628\u064E \u0631\u0650\u064A\u062D\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0631\u064E\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0647\u0650\u0645 \u0628\u064E\u0637\u064E\u0631\u0657\u0627 \u0648\u064E\u0631\u0650\u0626\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0645\u064F\u062D\u0650\u064A\u0637\u065E" }, { id: 48, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0632\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0627 \u063A\u064E\u0627\u0644\u0650\u0628\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u062C\u064E\u0627\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0627\u0653\u0621\u064E\u062A\u0650 \u0671\u0644\u06E1\u0641\u0650\u0626\u064E\u062A\u064E\u0627\u0646\u0650 \u0646\u064E\u0643\u064E\u0635\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u0642\u0650\u0628\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0628\u064E\u0631\u0650\u064A\u0653\u0621\u065E \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0631\u064E\u0649\u0670 \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 49, text: "\u0625\u0650\u0630\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u064C \u063A\u064E\u0631\u0651\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u062F\u0650\u064A\u0646\u064F\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 50, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u062A\u064E\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u06E1 \u064A\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u064F\u0648\u0646\u064E \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u062F\u06E1\u0628\u064E\u0670\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u0650\u064A\u0642\u0650" }, { id: 51, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u064A\u06E1\u0633\u064E \u0628\u0650\u0638\u064E\u0644\u0651\u064E\u0640\u0670\u0645\u0656 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0628\u0650\u064A\u062F\u0650" }, { id: 52, text: "\u0643\u064E\u062F\u064E\u0623\u06E1\u0628\u0650 \u0621\u064E\u0627\u0644\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u0648\u0650\u064A\u0651\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 53, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F \u0645\u064F\u063A\u064E\u064A\u0651\u0650\u0631\u0657\u0627 \u0646\u0651\u0650\u0639\u06E1\u0645\u064E\u0629\u064B \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u064E\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u064D \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u063A\u064E\u064A\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0628\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 54, text: "\u0643\u064E\u062F\u064E\u0623\u06E1\u0628\u0650 \u0621\u064E\u0627\u0644\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u065E \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0638\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 55, text: "\u0625\u0650\u0646\u0651\u064E \u0634\u064E\u0631\u0651\u064E \u0671\u0644\u062F\u0651\u064E\u0648\u064E\u0627\u0653\u0628\u0651\u0650 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u064E\u0670\u0647\u064E\u062F\u062A\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0646\u0642\u064F\u0636\u064F\u0648\u0646\u064E \u0639\u064E\u0647\u06E1\u062F\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u0631\u0651\u064E\u0629\u0656 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0641\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u062B\u06E1\u0642\u064E\u0641\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u0631\u06E1\u0628\u0650 \u0641\u064E\u0634\u064E\u0631\u0651\u0650\u062F\u06E1 \u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u062E\u064E\u0627\u0641\u064E\u0646\u0651\u064E \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u064D \u062E\u0650\u064A\u064E\u0627\u0646\u064E\u0629\u0657 \u0641\u064E\u0671\u0646\u06E2\u0628\u0650\u0630\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u062E\u064E\u0627\u0653\u0626\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 59, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0633\u064E\u0628\u064E\u0642\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0639\u06E1\u062C\u0650\u0632\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0648\u064E\u0623\u064E\u0639\u0650\u062F\u0651\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0639\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064F\u0648\u0651\u064E\u0629\u0656 \u0648\u064E\u0645\u0650\u0646 \u0631\u0651\u0650\u0628\u064E\u0627\u0637\u0650 \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0644\u0650 \u062A\u064F\u0631\u06E1\u0647\u0650\u0628\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u062F\u064F\u0648\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0639\u064E\u062F\u064F\u0648\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064F\u0648\u064E\u0641\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 61, text: "\u06DE\u0648\u064E\u0625\u0650\u0646 \u062C\u064E\u0646\u064E\u062D\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0633\u0651\u064E\u0644\u06E1\u0645\u0650 \u0641\u064E\u0671\u062C\u06E1\u0646\u064E\u062D\u06E1 \u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 62, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064E\u062E\u06E1\u062F\u064E\u0639\u064F\u0648\u0643\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u062D\u064E\u0633\u06E1\u0628\u064E\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u064A\u0651\u064E\u062F\u064E\u0643\u064E \u0628\u0650\u0646\u064E\u0635\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 63, text: "\u0648\u064E\u0623\u064E\u0644\u0651\u064E\u0641\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1\u06DA \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0641\u064E\u0642\u06E1\u062A\u064E \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0644\u0651\u064E\u0641\u06E1\u062A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0623\u064E\u0644\u0651\u064E\u0641\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 64, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u062D\u064E\u0633\u06E1\u0628\u064F\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 65, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u062D\u064E\u0631\u0651\u0650\u0636\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u0650\u062A\u064E\u0627\u0644\u0650\u06DA \u0625\u0650\u0646 \u064A\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0639\u0650\u0634\u06E1\u0631\u064F\u0648\u0646\u064E \u0635\u064E\u0670\u0628\u0650\u0631\u064F\u0648\u0646\u064E \u064A\u064E\u063A\u06E1\u0644\u0650\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0627\u0652\u0626\u064E\u062A\u064E\u064A\u06E1\u0646\u0650\u06DA \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0627\u0652\u0626\u064E\u0629\u065E \u064A\u064E\u063A\u06E1\u0644\u0650\u0628\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0644\u06E1\u0641\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0671\u0644\u06E1\u0640\u0654\u064E\u0670\u0646\u064E \u062E\u064E\u0641\u0651\u064E\u0641\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0639\u064E\u0644\u0650\u0645\u064E \u0623\u064E\u0646\u0651\u064E \u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u0636\u064E\u0639\u06E1\u0641\u0657\u0627\u06DA \u0641\u064E\u0625\u0650\u0646 \u064A\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0627\u0652\u0626\u064E\u0629\u065E \u0635\u064E\u0627\u0628\u0650\u0631\u064E\u0629\u065E \u064A\u064E\u063A\u06E1\u0644\u0650\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0627\u0652\u0626\u064E\u062A\u064E\u064A\u06E1\u0646\u0650\u06DA \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0623\u064E\u0644\u06E1\u0641\u065E \u064A\u064E\u063A\u06E1\u0644\u0650\u0628\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0644\u06E1\u0641\u064E\u064A\u06E1\u0646\u0650 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0639\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 67, text: "\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0646\u064E\u0628\u0650\u064A\u0651\u064D \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0633\u06E1\u0631\u064E\u0649\u0670 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u062B\u06E1\u062E\u0650\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u062A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0639\u064E\u0631\u064E\u0636\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 68, text: "\u0644\u0651\u064E\u0648\u06E1\u0644\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0633\u064E\u0628\u064E\u0642\u064E \u0644\u064E\u0645\u064E\u0633\u0651\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0645\u064E\u0627\u0653 \u0623\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 69, text: "\u0641\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u063A\u064E\u0646\u0650\u0645\u06E1\u062A\u064F\u0645\u06E1 \u062D\u064E\u0644\u064E\u0670\u0644\u0657\u0627 \u0637\u064E\u064A\u0651\u0650\u0628\u0657\u0627\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 70, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0642\u064F\u0644 \u0644\u0651\u0650\u0645\u064E\u0646 \u0641\u0650\u064A\u0653 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0646 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u064A\u064F\u0624\u06E1\u062A\u0650\u0643\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064F\u062E\u0650\u0630\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 71, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0627\u0652 \u062E\u0650\u064A\u064E\u0627\u0646\u064E\u062A\u064E\u0643\u064E \u0641\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0641\u064E\u0623\u064E\u0645\u06E1\u0643\u064E\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u064C" }, { id: 72, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064E\u0627\u062C\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0648\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0646\u064E\u0635\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064F \u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0647\u064E\u0627\u062C\u0650\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0648\u064E\u0644\u064E\u0670\u064A\u064E\u062A\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0647\u064E\u0627\u062C\u0650\u0631\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0625\u0650\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0646\u0635\u064E\u0631\u064F\u0648\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0635\u06E1\u0631\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u06ED \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u064A\u062B\u064E\u0670\u0642\u065E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 73, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064F \u0628\u064E\u0639\u06E1\u0636\u064D\u06DA \u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0647\u064F \u062A\u064E\u0643\u064F\u0646 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0641\u064E\u0633\u064E\u0627\u062F\u065E \u0643\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 74, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064E\u0627\u062C\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0648\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0646\u064E\u0635\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u062D\u064E\u0642\u0651\u0657\u0627\u06DA \u0644\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0631\u0650\u0632\u06E1\u0642\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u065E" }, { id: 75, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u064F \u0648\u064E\u0647\u064E\u0627\u062C\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u0650 \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2" }] }, { id: 9, name: "\u0627\u0644\u062A\u0648\u0628\u0629", transliteration: "At-Tawbah", type: "medinan", total_verses: 129, verses: [{ id: 1, text: "\u0628\u064E\u0631\u064E\u0627\u0653\u0621\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u064E\u0670\u0647\u064E\u062F\u062A\u0651\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 2, text: "\u0641\u064E\u0633\u0650\u064A\u062D\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064E\u0629\u064E \u0623\u064E\u0634\u06E1\u0647\u064F\u0631\u0656 \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u062E\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 3, text: "\u0648\u064E\u0623\u064E\u0630\u064E\u0670\u0646\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u062D\u064E\u062C\u0651\u0650 \u0671\u0644\u06E1\u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u0650 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u064E\u0631\u0650\u064A\u0653\u0621\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5\u06DA \u0641\u064E\u0625\u0650\u0646 \u062A\u064F\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u064D" }, { id: 4, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u064E\u0670\u0647\u064E\u062F\u062A\u0651\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0646\u0642\u064F\u0635\u064F\u0648\u0643\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0638\u064E\u0670\u0647\u0650\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u062D\u064E\u062F\u0657\u0627 \u0641\u064E\u0623\u064E\u062A\u0650\u0645\u0651\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0639\u064E\u0647\u06E1\u062F\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064F\u062F\u0651\u064E\u062A\u0650\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 5, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0646\u0633\u064E\u0644\u064E\u062E\u064E \u0671\u0644\u06E1\u0623\u064E\u0634\u06E1\u0647\u064F\u0631\u064F \u0671\u0644\u06E1\u062D\u064F\u0631\u064F\u0645\u064F \u0641\u064E\u0671\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u062D\u064E\u064A\u06E1\u062B\u064F \u0648\u064E\u062C\u064E\u062F\u062A\u0651\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u062E\u064F\u0630\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u062D\u06E1\u0635\u064F\u0631\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0642\u06E1\u0639\u064F\u062F\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0643\u064F\u0644\u0651\u064E \u0645\u064E\u0631\u06E1\u0635\u064E\u062F\u0656\u06DA \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0641\u064E\u062E\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0633\u064E\u0628\u0650\u064A\u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 6, text: "\u0648\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0627\u0631\u064E\u0643\u064E \u0641\u064E\u0623\u064E\u062C\u0650\u0631\u06E1\u0647\u064F \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064E \u0643\u064E\u0644\u064E\u0670\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0628\u06E1\u0644\u0650\u063A\u06E1\u0647\u064F \u0645\u064E\u0623\u06E1\u0645\u064E\u0646\u064E\u0647\u064F\u06E5\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0643\u064E\u064A\u06E1\u0641\u064E \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u0650\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0639\u064E\u0647\u06E1\u062F\u064C \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u064E\u0670\u0647\u064E\u062F\u062A\u0651\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650\u06D6 \u0641\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0642\u064E\u0670\u0645\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u0643\u064E\u064A\u06E1\u0641\u064E \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0638\u06E1\u0647\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u0642\u064F\u0628\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0630\u0650\u0645\u0651\u064E\u0629\u0657\u06DA \u064A\u064F\u0631\u06E1\u0636\u064F\u0648\u0646\u064E\u0643\u064F\u0645 \u0628\u0650\u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u062A\u064E\u0623\u06E1\u0628\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0671\u0634\u06E1\u062A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064E\u0645\u064E\u0646\u0657\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0641\u064E\u0635\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u0642\u064F\u0628\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064D \u0625\u0650\u0644\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0630\u0650\u0645\u0651\u064E\u0629\u0657\u06DA \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0639\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0641\u064E\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650\u06D7 \u0648\u064E\u0646\u064F\u0641\u064E\u0635\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u0625\u0650\u0646 \u0646\u0651\u064E\u0643\u064E\u062B\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0639\u064E\u0647\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0637\u064E\u0639\u064E\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062F\u0650\u064A\u0646\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0626\u0650\u0645\u0651\u064E\u0629\u064E \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u0650 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627\u0653 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u062A\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0623\u064E\u0644\u064E\u0627 \u062A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0646\u0651\u064E\u0643\u064E\u062B\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064E\u0645\u0651\u064F\u0648\u0627\u0652 \u0628\u0650\u0625\u0650\u062E\u06E1\u0631\u064E\u0627\u062C\u0650 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0648\u064E\u0647\u064F\u0645 \u0628\u064E\u062F\u064E\u0621\u064F\u0648\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u064D\u06DA \u0623\u064E\u062A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0641\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u062D\u064E\u0642\u0651\u064F \u0623\u064E\u0646 \u062A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0647\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0647\u064F\u0645\u06E1 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u062E\u06E1\u0632\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u0646\u0635\u064F\u0631\u06E1\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u0634\u06E1\u0641\u0650 \u0635\u064F\u062F\u064F\u0648\u0631\u064E \u0642\u064E\u0648\u06E1\u0645\u0656 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 15, text: "\u0648\u064E\u064A\u064F\u0630\u06E1\u0647\u0650\u0628\u06E1 \u063A\u064E\u064A\u06E1\u0638\u064E \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u064A\u064E\u062A\u064F\u0648\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u064C" }, { id: 16, text: "\u0623\u064E\u0645\u06E1 \u062D\u064E\u0633\u0650\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064F\u062A\u06E1\u0631\u064E\u0643\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0644\u0650\u064A\u062C\u064E\u0629\u0657\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u0639\u06E1\u0645\u064F\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0633\u064E\u0670\u062C\u0650\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645 \u0628\u0650\u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u0650\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u062D\u064E\u0628\u0650\u0637\u064E\u062A\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0647\u064F\u0645\u06E1 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064F\u0631\u064F \u0645\u064E\u0633\u064E\u0670\u062C\u0650\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0649 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062E\u06E1\u0634\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06D6 \u0641\u064E\u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 19, text: "\u06DE\u0623\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0633\u0650\u0642\u064E\u0627\u064A\u064E\u0629\u064E \u0671\u0644\u06E1\u062D\u064E\u0627\u0653\u062C\u0651\u0650 \u0648\u064E\u0639\u0650\u0645\u064E\u0627\u0631\u064E\u0629\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650 \u0643\u064E\u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u062C\u064E\u0670\u0647\u064E\u062F\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u064F\u06E5\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 20, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064E\u0627\u062C\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0638\u064E\u0645\u064F \u062F\u064E\u0631\u064E\u062C\u064E\u0629\u064B \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0627\u0653\u0626\u0650\u0632\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u064A\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064F\u0647\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645 \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u0656 \u0648\u064E\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0646\u064E\u0639\u0650\u064A\u0645\u065E \u0645\u0651\u064F\u0642\u0650\u064A\u0645\u064C" }, { id: 22, text: "\u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062C\u06E1\u0631\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 23, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u062D\u064E\u0628\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0639\u064E\u0634\u0650\u064A\u0631\u064E\u062A\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064C \u0671\u0642\u06E1\u062A\u064E\u0631\u064E\u0641\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u062A\u0650\u062C\u064E\u0670\u0631\u064E\u0629\u065E \u062A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u064E \u0643\u064E\u0633\u064E\u0627\u062F\u064E\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u064F \u062A\u064E\u0631\u06E1\u0636\u064E\u0648\u06E1\u0646\u064E\u0647\u064E\u0627\u0653 \u0623\u064E\u062D\u064E\u0628\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u062C\u0650\u0647\u064E\u0627\u062F\u0656 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 25, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0646\u064E\u0635\u064E\u0631\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A \u0645\u064E\u0648\u064E\u0627\u0637\u0650\u0646\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u0656 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u062D\u064F\u0646\u064E\u064A\u06E1\u0646\u064D \u0625\u0650\u0630\u06E1 \u0623\u064E\u0639\u06E1\u062C\u064E\u0628\u064E\u062A\u06E1\u0643\u064F\u0645\u06E1 \u0643\u064E\u062B\u06E1\u0631\u064E\u062A\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0645\u06E1 \u062A\u064F\u063A\u06E1\u0646\u0650 \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0636\u064E\u0627\u0642\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0628\u0650\u0645\u064E\u0627 \u0631\u064E\u062D\u064F\u0628\u064E\u062A\u06E1 \u062B\u064F\u0645\u0651\u064E \u0648\u064E\u0644\u0651\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u064F\u062F\u06E1\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0643\u0650\u064A\u0646\u064E\u062A\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u062C\u064F\u0646\u064F\u0648\u062F\u0657\u0627 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E\u0648\u06E1\u0647\u064E\u0627 \u0648\u064E\u0639\u064E\u0630\u0651\u064E\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 27, text: "\u062B\u064F\u0645\u0651\u064E \u064A\u064E\u062A\u064F\u0648\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 28, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E \u0646\u064E\u062C\u064E\u0633\u065E \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0639\u064E\u0627\u0645\u0650\u0647\u0650\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u06DA \u0648\u064E\u0625\u0650\u0646\u06E1 \u062E\u0650\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0639\u064E\u064A\u06E1\u0644\u064E\u0629\u0657 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064F\u063A\u06E1\u0646\u0650\u064A\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 29, text: "\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u062D\u064E\u0631\u0651\u0650\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062F\u0650\u064A\u0646\u064F\u0648\u0646\u064E \u062F\u0650\u064A\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0639\u06E1\u0637\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062C\u0650\u0632\u06E1\u064A\u064E\u0629\u064E \u0639\u064E\u0646 \u064A\u064E\u062F\u0656 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0635\u064E\u0670\u063A\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u064A\u064E\u0647\u064F\u0648\u062F\u064F \u0639\u064F\u0632\u064E\u064A\u06E1\u0631\u064C \u0671\u0628\u06E1\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u0635\u064E\u0670\u0631\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064F \u0671\u0628\u06E1\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0642\u064E\u0648\u06E1\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0647\u0650\u0645\u06E1\u06D6 \u064A\u064F\u0636\u064E\u0670\u0647\u0650\u0640\u0654\u064F\u0648\u0646\u064E \u0642\u064E\u0648\u06E1\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06DA \u0642\u064E\u0670\u062A\u064E\u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062D\u06E1\u0628\u064E\u0627\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0631\u064F\u0647\u06E1\u0628\u064E\u0670\u0646\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0631\u06E1\u0628\u064E\u0627\u0628\u0657\u0627 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u0650\u064A\u062D\u064E \u0671\u0628\u06E1\u0646\u064E \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0645\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0670\u0647\u0657\u0627 \u0648\u064E\u0670\u062D\u0650\u062F\u0657\u0627\u06D6 \u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064F\u0637\u06E1\u0641\u0650\u0640\u0654\u064F\u0648\u0627\u0652 \u0646\u064F\u0648\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u0623\u06E1\u0628\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u062A\u0650\u0645\u0651\u064E \u0646\u064F\u0648\u0631\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0631\u0650\u0647\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0648\u064E\u062F\u0650\u064A\u0646\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u0650\u064A\u064F\u0638\u06E1\u0647\u0650\u0631\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0643\u064F\u0644\u0651\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0631\u0650\u0647\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u06DE\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0628\u064E\u0627\u0631\u0650 \u0648\u064E\u0671\u0644\u0631\u0651\u064F\u0647\u06E1\u0628\u064E\u0627\u0646\u0650 \u0644\u064E\u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u0648\u064E\u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0643\u06E1\u0646\u0650\u0632\u064F\u0648\u0646\u064E \u0671\u0644\u0630\u0651\u064E\u0647\u064E\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u0641\u0650\u0636\u0651\u064E\u0629\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u06E1\u0647\u064F\u0645 \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 35, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u062D\u06E1\u0645\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0641\u0650\u064A \u0646\u064E\u0627\u0631\u0650 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0641\u064E\u062A\u064F\u0643\u06E1\u0648\u064E\u0649\u0670 \u0628\u0650\u0647\u064E\u0627 \u062C\u0650\u0628\u064E\u0627\u0647\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0638\u064F\u0647\u064F\u0648\u0631\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u0646\u064E\u0632\u06E1\u062A\u064F\u0645\u06E1 \u0644\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u0646\u0650\u0632\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0625\u0650\u0646\u0651\u064E \u0639\u0650\u062F\u0651\u064E\u0629\u064E \u0671\u0644\u0634\u0651\u064F\u0647\u064F\u0648\u0631\u0650 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u062B\u06E1\u0646\u064E\u0627 \u0639\u064E\u0634\u064E\u0631\u064E \u0634\u064E\u0647\u06E1\u0631\u0657\u0627 \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064E\u0629\u064C \u062D\u064F\u0631\u064F\u0645\u065E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064F \u0671\u0644\u06E1\u0642\u064E\u064A\u0651\u0650\u0645\u064F\u06DA \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0643\u064E\u0627\u0653\u0641\u0651\u064E\u0629\u0657 \u0643\u064E\u0645\u064E\u0627 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0643\u064E\u0627\u0653\u0641\u0651\u064E\u0629\u0657\u06DA \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 37, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0633\u0650\u064A\u0653\u0621\u064F \u0632\u0650\u064A\u064E\u0627\u062F\u064E\u0629\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u0650\u06D6 \u064A\u064F\u0636\u064E\u0644\u0651\u064F \u0628\u0650\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u064A\u064F\u062D\u0650\u0644\u0651\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0639\u064E\u0627\u0645\u0657\u0627 \u0648\u064E\u064A\u064F\u062D\u064E\u0631\u0651\u0650\u0645\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0639\u064E\u0627\u0645\u0657\u0627 \u0644\u0651\u0650\u064A\u064F\u0648\u064E\u0627\u0637\u0650\u0640\u0654\u064F\u0648\u0627\u0652 \u0639\u0650\u062F\u0651\u064E\u0629\u064E \u0645\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u064A\u064F\u062D\u0650\u0644\u0651\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0632\u064F\u064A\u0651\u0650\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064F \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0646\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u062B\u0651\u064E\u0627\u0642\u064E\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0623\u064E\u0631\u064E\u0636\u0650\u064A\u062A\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06DA \u0641\u064E\u0645\u064E\u0627 \u0645\u064E\u062A\u064E\u0670\u0639\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u064C" }, { id: 39, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u0646\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u06E1\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u0628\u06E1\u062F\u0650\u0644\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0636\u064F\u0631\u0651\u064F\u0648\u0647\u064F \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 40, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u0646\u0635\u064F\u0631\u064F\u0648\u0647\u064F \u0641\u064E\u0642\u064E\u062F\u06E1 \u0646\u064E\u0635\u064E\u0631\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0630\u06E1 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u062B\u064E\u0627\u0646\u0650\u064A\u064E \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650 \u0625\u0650\u0630\u06E1 \u0647\u064F\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u063A\u064E\u0627\u0631\u0650 \u0625\u0650\u0630\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u0650\u0635\u064E\u0670\u062D\u0650\u0628\u0650\u0647\u0650\u06E6 \u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0639\u064E\u0646\u064E\u0627\u06D6 \u0641\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0643\u0650\u064A\u0646\u064E\u062A\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0623\u064E\u064A\u0651\u064E\u062F\u064E\u0647\u064F\u06E5 \u0628\u0650\u062C\u064F\u0646\u064F\u0648\u062F\u0656 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E\u0648\u06E1\u0647\u064E\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064F\u0641\u06E1\u0644\u064E\u0649\u0670\u06D7 \u0648\u064E\u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u0650\u064A\u064E \u0671\u0644\u06E1\u0639\u064F\u0644\u06E1\u064A\u064E\u0627\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u064C" }, { id: 41, text: "\u0671\u0646\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u062E\u0650\u0641\u064E\u0627\u0641\u0657\u0627 \u0648\u064E\u062B\u0650\u0642\u064E\u0627\u0644\u0657\u0627 \u0648\u064E\u062C\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0631\u064E\u0636\u0657\u0627 \u0642\u064E\u0631\u0650\u064A\u0628\u0657\u0627 \u0648\u064E\u0633\u064E\u0641\u064E\u0631\u0657\u0627 \u0642\u064E\u0627\u0635\u0650\u062F\u0657\u0627 \u0644\u0651\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0643\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u06E2 \u0628\u064E\u0639\u064F\u062F\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0634\u0651\u064F\u0642\u0651\u064E\u0629\u064F\u06DA \u0648\u064E\u0633\u064E\u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0648\u0650 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627 \u0644\u064E\u062E\u064E\u0631\u064E\u062C\u06E1\u0646\u064E\u0627 \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u064A\u064F\u0647\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0639\u064E\u0641\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u0643\u064E \u0644\u0650\u0645\u064E \u0623\u064E\u0630\u0650\u0646\u062A\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0635\u064E\u062F\u064E\u0642\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 44, text: "\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u0650\u0646\u064F\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0623\u064E\u0646 \u064A\u064F\u062C\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 45, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u0650\u0646\u064F\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u0671\u0631\u06E1\u062A\u064E\u0627\u0628\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0631\u064E\u064A\u06E1\u0628\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u062A\u064E\u0631\u064E\u062F\u0651\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u06DE\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062E\u064F\u0631\u064F\u0648\u062C\u064E \u0644\u064E\u0623\u064E\u0639\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0639\u064F\u062F\u0651\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0631\u0650\u0647\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0646\u06E2\u0628\u0650\u0639\u064E\u0627\u062B\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u062B\u064E\u0628\u0651\u064E\u0637\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0671\u0642\u06E1\u0639\u064F\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0642\u064E\u0670\u0639\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0644\u064E\u0648\u06E1 \u062E\u064E\u0631\u064E\u062C\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0632\u064E\u0627\u062F\u064F\u0648\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u062E\u064E\u0628\u064E\u0627\u0644\u0657\u0627 \u0648\u064E\u0644\u064E\u0623\u064E\u0648\u06E1\u0636\u064E\u0639\u064F\u0648\u0627\u0652 \u062E\u0650\u0644\u064E\u0670\u0644\u064E\u0643\u064F\u0645\u06E1 \u064A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u064E \u0648\u064E\u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u0633\u064E\u0645\u0651\u064E\u0640\u0670\u0639\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0644\u064E\u0642\u064E\u062F\u0650 \u0671\u0628\u06E1\u062A\u064E\u063A\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0642\u064E\u0644\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064E \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062C\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0638\u064E\u0647\u064E\u0631\u064E \u0623\u064E\u0645\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0670\u0631\u0650\u0647\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0626\u06E1\u0630\u064E\u0646 \u0644\u0651\u0650\u064A \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0641\u06E1\u062A\u0650\u0646\u0651\u0650\u064A\u0653\u06DA \u0623\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0650 \u0633\u064E\u0642\u064E\u0637\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0644\u064E\u0645\u064F\u062D\u0650\u064A\u0637\u064E\u0629\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0625\u0650\u0646 \u062A\u064F\u0635\u0650\u0628\u06E1\u0643\u064E \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u065E \u062A\u064E\u0633\u064F\u0624\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0635\u0650\u0628\u06E1\u0643\u064E \u0645\u064F\u0635\u0650\u064A\u0628\u064E\u0629\u065E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0642\u064E\u062F\u06E1 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0631\u064E\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0631\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0646 \u064A\u064F\u0635\u0650\u064A\u0628\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u062A\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0646\u064E\u0627 \u0647\u064F\u0648\u064E \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0646\u064E\u0627\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0642\u064F\u0644\u06E1 \u0647\u064E\u0644\u06E1 \u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u064F\u0648\u0646\u064E \u0628\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u062D\u06E1\u062F\u064E\u0649 \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u064A\u064E\u064A\u06E1\u0646\u0650\u06D6 \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0646\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u064F \u0628\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064F\u0635\u0650\u064A\u0628\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u06E1 \u0628\u0650\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0646\u064E\u0627\u06D6 \u0641\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064E\u0639\u064E\u0643\u064F\u0645 \u0645\u0651\u064F\u062A\u064E\u0631\u064E\u0628\u0651\u0650\u0635\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0637\u064E\u0648\u06E1\u0639\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0643\u064E\u0631\u06E1\u0647\u0657\u0627 \u0644\u0651\u064E\u0646 \u064A\u064F\u062A\u064E\u0642\u064E\u0628\u0651\u064E\u0644\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u0648\u064E\u0645\u064E\u0627 \u0645\u064E\u0646\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064F\u0642\u06E1\u0628\u064E\u0644\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0646\u064E\u0641\u064E\u0642\u064E\u0670\u062A\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0628\u0650\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0643\u064F\u0633\u064E\u0627\u0644\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0670\u0631\u0650\u0647\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0639\u06E1\u062C\u0650\u0628\u06E1\u0643\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064F\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E\u0647\u064F\u0645 \u0628\u0650\u0647\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u062A\u064E\u0632\u06E1\u0647\u064E\u0642\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0648\u064E\u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u064A\u064E\u0641\u06E1\u0631\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0644\u064E\u0648\u06E1 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0645\u064E\u0644\u06E1\u062C\u064E\u0640\u0654\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0645\u064E\u063A\u064E\u0670\u0631\u064E\u0670\u062A\u064D \u0623\u064E\u0648\u06E1 \u0645\u064F\u062F\u0651\u064E\u062E\u064E\u0644\u0657\u0627 \u0644\u0651\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062C\u06E1\u0645\u064E\u062D\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0644\u06E1\u0645\u0650\u0632\u064F\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064E\u062F\u064E\u0642\u064E\u0670\u062A\u0650 \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064F\u0639\u06E1\u0637\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0648\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064F\u0639\u06E1\u0637\u064E\u0648\u06E1\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u0653 \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062E\u064E\u0637\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062D\u064E\u0633\u06E1\u0628\u064F\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0670\u063A\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u06DE\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u0635\u0651\u064E\u062F\u064E\u0642\u064E\u0670\u062A\u064F \u0644\u0650\u0644\u06E1\u0641\u064F\u0642\u064E\u0631\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0670\u0645\u0650\u0644\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u064E\u0644\u0651\u064E\u0641\u064E\u0629\u0650 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u0631\u0651\u0650\u0642\u064E\u0627\u0628\u0650 \u0648\u064E\u0671\u0644\u06E1\u063A\u064E\u0670\u0631\u0650\u0645\u0650\u064A\u0646\u064E \u0648\u064E\u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0628\u06E1\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650\u06D6 \u0641\u064E\u0631\u0650\u064A\u0636\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 61, text: "\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0630\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064E \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0647\u064F\u0648\u064E \u0623\u064F\u0630\u064F\u0646\u065E\u06DA \u0642\u064F\u0644\u06E1 \u0623\u064F\u0630\u064F\u0646\u064F \u062E\u064E\u064A\u06E1\u0631\u0656 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0630\u064F\u0648\u0646\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 62, text: "\u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u0650\u064A\u064F\u0631\u06E1\u0636\u064F\u0648\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u062D\u064E\u0642\u0651\u064F \u0623\u064E\u0646 \u064A\u064F\u0631\u06E1\u0636\u064F\u0648\u0647\u064F \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 63, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646 \u064A\u064F\u062D\u064E\u0627\u062F\u0650\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0641\u064E\u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u06E5 \u0646\u064E\u0627\u0631\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u0657\u0627 \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u062E\u0650\u0632\u06E1\u064A\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 64, text: "\u064A\u064E\u062D\u06E1\u0630\u064E\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u062A\u064F\u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0633\u064F\u0648\u0631\u064E\u0629\u065E \u062A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1\u06DA \u0642\u064F\u0644\u0650 \u0671\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u062E\u06E1\u0631\u0650\u062C\u065E \u0645\u0651\u064E\u0627 \u062A\u064E\u062D\u06E1\u0630\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0646\u0651\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u062E\u064F\u0648\u0636\u064F \u0648\u064E\u0646\u064E\u0644\u06E1\u0639\u064E\u0628\u064F\u06DA \u0642\u064F\u0644\u06E1 \u0623\u064E\u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062A\u064E\u0630\u0650\u0631\u064F\u0648\u0627\u0652 \u0642\u064E\u062F\u06E1 \u0643\u064E\u0641\u064E\u0631\u06E1\u062A\u064F\u0645 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646 \u0646\u0651\u064E\u0639\u06E1\u0641\u064F \u0639\u064E\u0646 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0646\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u06E1 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u064E\u06E2 \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 67, text: "\u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064E\u0670\u062A\u064F \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650 \u0648\u064E\u064A\u064E\u0646\u06E1\u0647\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0648\u064E\u064A\u064E\u0642\u06E1\u0628\u0650\u0636\u064F\u0648\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u06E1\u06DA \u0646\u064E\u0633\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0646\u064E\u0633\u0650\u064A\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0648\u064E\u0639\u064E\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064E \u0646\u064E\u0627\u0631\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0647\u0650\u064A\u064E \u062D\u064E\u0633\u06E1\u0628\u064F\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u0639\u064E\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0642\u0650\u064A\u0645\u065E" }, { id: 69, text: "\u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0634\u064E\u062F\u0651\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0642\u064F\u0648\u0651\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0657\u0627 \u0648\u064E\u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u0657\u0627 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0645\u06E1\u062A\u064E\u0639\u064F\u0648\u0627\u0652 \u0628\u0650\u062E\u064E\u0644\u064E\u0670\u0642\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0645\u06E1\u062A\u064E\u0639\u06E1\u062A\u064F\u0645 \u0628\u0650\u062E\u064E\u0644\u064E\u0670\u0642\u0650\u0643\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0645\u06E1\u062A\u064E\u0639\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645 \u0628\u0650\u062E\u064E\u0644\u064E\u0670\u0642\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u062E\u064F\u0636\u06E1\u062A\u064F\u0645\u06E1 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0627\u0636\u064F\u0648\u0653\u0627\u0652\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u062D\u064E\u0628\u0650\u0637\u064E\u062A\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u0647\u0650\u0645\u06E1 \u0646\u064E\u0628\u064E\u0623\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u0650 \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0639\u064E\u0627\u062F\u0656 \u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064E \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u0650 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0645\u064E\u062F\u06E1\u064A\u064E\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u062A\u064E\u0641\u0650\u0643\u064E\u0670\u062A\u0650\u06DA \u0623\u064E\u062A\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650\u06D6 \u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u064F \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064F \u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0648\u064E\u064A\u064E\u0646\u06E1\u0647\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650 \u0648\u064E\u064A\u064F\u0642\u0650\u064A\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u064A\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u064A\u064F\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5\u0653\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0633\u064E\u064A\u064E\u0631\u06E1\u062D\u064E\u0645\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 72, text: "\u0648\u064E\u0639\u064E\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u064E \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0629\u0657 \u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0639\u064E\u062F\u06E1\u0646\u0656\u06DA \u0648\u064E\u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 73, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u062C\u064E\u0670\u0647\u0650\u062F\u0650 \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u063A\u06E1\u0644\u064F\u0638\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 74, text: "\u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064E \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u0650 \u0648\u064E\u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0633\u06E1\u0644\u064E\u0670\u0645\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0647\u064E\u0645\u0651\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0646\u064E\u0627\u0644\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u0642\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u06DA \u0641\u064E\u0625\u0650\u0646 \u064A\u064E\u062A\u064F\u0648\u0628\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u064F \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u0656" }, { id: 75, text: "\u06DE\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0639\u064E\u0670\u0647\u064E\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0626\u0650\u0646\u06E1 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0646\u064E\u0627 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0644\u064E\u0646\u064E\u0635\u0651\u064E\u062F\u0651\u064E\u0642\u064E\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0646\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 76, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0628\u064E\u062E\u0650\u0644\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 77, text: "\u0641\u064E\u0623\u064E\u0639\u06E1\u0642\u064E\u0628\u064E\u0647\u064F\u0645\u06E1 \u0646\u0650\u0641\u064E\u0627\u0642\u0657\u0627 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u064A\u064E\u0644\u06E1\u0642\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0644\u064E\u0641\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0648\u064E\u0639\u064E\u062F\u064F\u0648\u0647\u064F \u0648\u064E\u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 78, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0633\u0650\u0631\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0646\u064E\u062C\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0651\u064E\u0640\u0670\u0645\u064F \u0671\u0644\u06E1\u063A\u064F\u064A\u064F\u0648\u0628\u0650" }, { id: 79, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0644\u06E1\u0645\u0650\u0632\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0637\u0651\u064E\u0648\u0651\u0650\u0639\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064E\u062F\u064E\u0642\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u062C\u064F\u0647\u06E1\u062F\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u064A\u064E\u0633\u06E1\u062E\u064E\u0631\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u062E\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 80, text: "\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646 \u062A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u0628\u06E1\u0639\u0650\u064A\u0646\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u0657 \u0641\u064E\u0644\u064E\u0646 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 81, text: "\u0641\u064E\u0631\u0650\u062D\u064E \u0671\u0644\u06E1\u0645\u064F\u062E\u064E\u0644\u0651\u064E\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0645\u064E\u0642\u06E1\u0639\u064E\u062F\u0650\u0647\u0650\u0645\u06E1 \u062E\u0650\u0644\u064E\u0670\u0641\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u064E\u0631\u0650\u0647\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064F\u062C\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0646\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u0631\u0651\u0650\u06D7 \u0642\u064F\u0644\u06E1 \u0646\u064E\u0627\u0631\u064F \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u062D\u064E\u0631\u0651\u0657\u0627\u06DA \u0644\u0651\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 82, text: "\u0641\u064E\u0644\u06E1\u064A\u064E\u0636\u06E1\u062D\u064E\u0643\u064F\u0648\u0627\u0652 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0648\u064E\u0644\u06E1\u064A\u064E\u0628\u06E1\u0643\u064F\u0648\u0627\u0652 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064E\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0641\u064E\u0625\u0650\u0646 \u0631\u0651\u064E\u062C\u064E\u0639\u064E\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u064E\u0646\u064F\u0648\u0643\u064E \u0644\u0650\u0644\u06E1\u062E\u064F\u0631\u064F\u0648\u062C\u0650 \u0641\u064E\u0642\u064F\u0644 \u0644\u0651\u064E\u0646 \u062A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u0650\u064A\u064E \u0623\u064E\u0628\u064E\u062F\u0657\u0627 \u0648\u064E\u0644\u064E\u0646 \u062A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u0650\u064A\u064E \u0639\u064E\u062F\u064F\u0648\u0651\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0636\u0650\u064A\u062A\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0642\u064F\u0639\u064F\u0648\u062F\u0650 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u0656 \u0641\u064E\u0671\u0642\u06E1\u0639\u064F\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0644\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 84, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0635\u064E\u0644\u0651\u0650 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627\u062A\u064E \u0623\u064E\u0628\u064E\u062F\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0628\u06E1\u0631\u0650\u0647\u0650\u06E6\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0645\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 85, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0639\u06E1\u062C\u0650\u0628\u06E1\u0643\u064E \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064F\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E\u0647\u064F\u0645 \u0628\u0650\u0647\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u062A\u064E\u0632\u06E1\u0647\u064E\u0642\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 86, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E\u062A\u06E1 \u0633\u064F\u0648\u0631\u064E\u0629\u064C \u0623\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u062C\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650 \u0671\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u064E\u0646\u064E\u0643\u064E \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0637\u0651\u064E\u0648\u06E1\u0644\u0650 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0630\u064E\u0631\u06E1\u0646\u064E\u0627 \u0646\u064E\u0643\u064F\u0646 \u0645\u0651\u064E\u0639\u064E \u0671\u0644\u06E1\u0642\u064E\u0670\u0639\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 87, text: "\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u062E\u064E\u0648\u064E\u0627\u0644\u0650\u0641\u0650 \u0648\u064E\u0637\u064F\u0628\u0650\u0639\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 88, text: "\u0644\u064E\u0670\u0643\u0650\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064E\u0670\u062A\u064F\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 89, text: "\u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 90, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u06E1\u0645\u064F\u0639\u064E\u0630\u0651\u0650\u0631\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0628\u0650 \u0644\u0650\u064A\u064F\u0624\u06E1\u0630\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u0639\u064E\u062F\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u064E\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5\u06DA \u0633\u064E\u064A\u064F\u0635\u0650\u064A\u0628\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 91, text: "\u0644\u0651\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0636\u0651\u064F\u0639\u064E\u0641\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u0636\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u062D\u064E\u0631\u064E\u062C\u064C \u0625\u0650\u0630\u064E\u0627 \u0646\u064E\u0635\u064E\u062D\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6\u06DA \u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0656\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 92, text: "\u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0648\u06E1\u0643\u064E \u0644\u0650\u062A\u064E\u062D\u06E1\u0645\u0650\u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064F\u0644\u06E1\u062A\u064E \u0644\u064E\u0627\u0653 \u0623\u064E\u062C\u0650\u062F\u064F \u0645\u064E\u0627\u0653 \u0623\u064E\u062D\u06E1\u0645\u0650\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u064F\u0647\u064F\u0645\u06E1 \u062A\u064E\u0641\u0650\u064A\u0636\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u062F\u0651\u064E\u0645\u06E1\u0639\u0650 \u062D\u064E\u0632\u064E\u0646\u064B\u0627 \u0623\u064E\u0644\u0651\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 93, text: "\u06DE\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u0650\u0646\u064F\u0648\u0646\u064E\u0643\u064E \u0648\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u063A\u06E1\u0646\u0650\u064A\u064E\u0627\u0653\u0621\u064F\u06DA \u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u062E\u064E\u0648\u064E\u0627\u0644\u0650\u0641\u0650 \u0648\u064E\u0637\u064E\u0628\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 94, text: "\u064A\u064E\u0639\u06E1\u062A\u064E\u0630\u0650\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u062C\u064E\u0639\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0642\u064F\u0644 \u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u062A\u064E\u0630\u0650\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u0646\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0642\u064E\u062F\u06E1 \u0646\u064E\u0628\u0651\u064E\u0623\u064E\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u06E1 \u0623\u064E\u062E\u06E1\u0628\u064E\u0627\u0631\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0633\u064E\u064A\u064E\u0631\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0645\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u062A\u064F\u0631\u064E\u062F\u0651\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0670\u0644\u0650\u0645\u0650 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650 \u0641\u064E\u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 95, text: "\u0633\u064E\u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0671\u0646\u0642\u064E\u0644\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0644\u0650\u062A\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0631\u0650\u062C\u06E1\u0633\u065E\u06D6 \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064E\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 96, text: "\u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u0650\u062A\u064E\u0631\u06E1\u0636\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0631\u06E1\u0636\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 97, text: "\u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0628\u064F \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0643\u064F\u0641\u06E1\u0631\u0657\u0627 \u0648\u064E\u0646\u0650\u0641\u064E\u0627\u0642\u0657\u0627 \u0648\u064E\u0623\u064E\u062C\u06E1\u062F\u064E\u0631\u064F \u0623\u064E\u0644\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u062D\u064F\u062F\u064F\u0648\u062F\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 98, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0628\u0650 \u0645\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F \u0645\u064E\u0627 \u064A\u064F\u0646\u0641\u0650\u0642\u064F \u0645\u064E\u063A\u06E1\u0631\u064E\u0645\u0657\u0627 \u0648\u064E\u064A\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u064F \u0628\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u062F\u0651\u064E\u0648\u064E\u0627\u0653\u0626\u0650\u0631\u064E\u06DA \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062F\u064E\u0627\u0653\u0626\u0650\u0631\u064E\u0629\u064F \u0671\u0644\u0633\u0651\u064E\u0648\u06E1\u0621\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 99, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0628\u0650 \u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u0648\u064E\u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F \u0645\u064E\u0627 \u064A\u064F\u0646\u0641\u0650\u0642\u064F \u0642\u064F\u0631\u064F\u0628\u064E\u0670\u062A\u064D \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0635\u064E\u0644\u064E\u0648\u064E\u0670\u062A\u0650 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650\u06DA \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0642\u064F\u0631\u06E1\u0628\u064E\u0629\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u06E1\u06DA \u0633\u064E\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 100, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0640\u0670\u0628\u0650\u0642\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0647\u064E\u0670\u062C\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u0635\u064E\u0627\u0631\u0650 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0647\u064F\u0645 \u0628\u0650\u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u0656 \u0631\u0651\u064E\u0636\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F \u0648\u064E\u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u062A\u064E\u062D\u06E1\u062A\u064E\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 101, text: "\u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0646\u06E1 \u062D\u064E\u0648\u06E1\u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0628\u0650 \u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064F\u0648\u0646\u064E\u06D6 \u0648\u064E\u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u0645\u064E\u0631\u064E\u062F\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u0650\u0641\u064E\u0627\u0642\u0650 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0646\u064E\u062D\u06E1\u0646\u064F \u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0647\u064F\u0645\u06E1\u06DA \u0633\u064E\u0646\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0647\u064F\u0645 \u0645\u0651\u064E\u0631\u0651\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0631\u064E\u062F\u0651\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 102, text: "\u0648\u064E\u0621\u064E\u0627\u062E\u064E\u0631\u064F\u0648\u0646\u064E \u0671\u0639\u06E1\u062A\u064E\u0631\u064E\u0641\u064F\u0648\u0627\u0652 \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u062E\u064E\u0644\u064E\u0637\u064F\u0648\u0627\u0652 \u0639\u064E\u0645\u064E\u0644\u0657\u0627 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0648\u064E\u0621\u064E\u0627\u062E\u064E\u0631\u064E \u0633\u064E\u064A\u0651\u0650\u0626\u064B\u0627 \u0639\u064E\u0633\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064E\u062A\u064F\u0648\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 103, text: "\u062E\u064F\u0630\u06E1 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u0635\u064E\u062F\u064E\u0642\u064E\u0629\u0657 \u062A\u064F\u0637\u064E\u0647\u0651\u0650\u0631\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u062A\u064F\u0632\u064E\u0643\u0651\u0650\u064A\u0647\u0650\u0645 \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0635\u064E\u0644\u0651\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E \u0635\u064E\u0644\u064E\u0648\u0670\u062A\u064E\u0643\u064E \u0633\u064E\u0643\u064E\u0646\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 104, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u064A\u064E\u0642\u06E1\u0628\u064E\u0644\u064F \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0628\u064E\u0629\u064E \u0639\u064E\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F \u0671\u0644\u0635\u0651\u064E\u062F\u064E\u0642\u064E\u0670\u062A\u0650 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u0651\u064E\u0627\u0628\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 105, text: "\u0648\u064E\u0642\u064F\u0644\u0650 \u0671\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0633\u064E\u064A\u064E\u0631\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0645\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E\u06D6 \u0648\u064E\u0633\u064E\u062A\u064F\u0631\u064E\u062F\u0651\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0670\u0644\u0650\u0645\u0650 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650 \u0641\u064E\u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 106, text: "\u0648\u064E\u0621\u064E\u0627\u062E\u064E\u0631\u064F\u0648\u0646\u064E \u0645\u064F\u0631\u06E1\u062C\u064E\u0648\u06E1\u0646\u064E \u0644\u0650\u0623\u064E\u0645\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0645\u0651\u064E\u0627 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u062A\u064F\u0648\u0628\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 107, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0657\u0627 \u0636\u0650\u0631\u064E\u0627\u0631\u0657\u0627 \u0648\u064E\u0643\u064F\u0641\u06E1\u0631\u0657\u0627 \u0648\u064E\u062A\u064E\u0641\u06E1\u0631\u0650\u064A\u0642\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0625\u0650\u0631\u06E1\u0635\u064E\u0627\u062F\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0646\u06E1 \u062D\u064E\u0627\u0631\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06DA \u0648\u064E\u0644\u064E\u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0646\u0651\u064E \u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 108, text: "\u0644\u064E\u0627 \u062A\u064E\u0642\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06DA \u0644\u0651\u064E\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u064C \u0623\u064F\u0633\u0651\u0650\u0633\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0648\u0651\u064E\u0644\u0650 \u064A\u064E\u0648\u06E1\u0645\u064D \u0623\u064E\u062D\u064E\u0642\u0651\u064F \u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0645\u064E \u0641\u0650\u064A\u0647\u0650\u06DA \u0641\u0650\u064A\u0647\u0650 \u0631\u0650\u062C\u064E\u0627\u0644\u065E \u064A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u062A\u064E\u0637\u064E\u0647\u0651\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0637\u0651\u064E\u0647\u0651\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 109, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0633\u0651\u064E\u0633\u064E \u0628\u064F\u0646\u06E1\u064A\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u062A\u064E\u0642\u06E1\u0648\u064E\u0649\u0670 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u064D \u062E\u064E\u064A\u06E1\u0631\u064C \u0623\u064E\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0623\u064E\u0633\u0651\u064E\u0633\u064E \u0628\u064F\u0646\u06E1\u064A\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u0641\u064E\u0627 \u062C\u064F\u0631\u064F\u0641\u064D \u0647\u064E\u0627\u0631\u0656 \u0641\u064E\u0671\u0646\u06E1\u0647\u064E\u0627\u0631\u064E \u0628\u0650\u0647\u0650\u06E6 \u0641\u0650\u064A \u0646\u064E\u0627\u0631\u0650 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 110, text: "\u0644\u064E\u0627 \u064A\u064E\u0632\u064E\u0627\u0644\u064F \u0628\u064F\u0646\u06E1\u064A\u064E\u0670\u0646\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u064E\u0646\u064E\u0648\u06E1\u0627\u0652 \u0631\u0650\u064A\u0628\u064E\u0629\u0657 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0642\u064E\u0637\u0651\u064E\u0639\u064E \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u064C" }, { id: 111, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0634\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E\u06DA \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u064A\u064F\u0642\u06E1\u062A\u064E\u0644\u064F\u0648\u0646\u064E\u06D6 \u0648\u064E\u0639\u06E1\u062F\u064B\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062D\u064E\u0642\u0651\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u0650 \u0648\u064E\u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650\u06DA \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0648\u06E1\u0641\u064E\u0649\u0670 \u0628\u0650\u0639\u064E\u0647\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0628\u06E1\u0634\u0650\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0628\u064E\u064A\u06E1\u0639\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u064E\u0627\u064A\u064E\u0639\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 112, text: "\u0671\u0644\u062A\u0651\u064E\u0640\u0670\u0653\u0626\u0650\u0628\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0670\u0628\u0650\u062F\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0670\u0645\u0650\u062F\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0640\u0670\u0653\u0626\u0650\u062D\u064F\u0648\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0643\u0650\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0640\u0670\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u0645\u0650\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0627\u0647\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650 \u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u0670\u0641\u0650\u0638\u064F\u0648\u0646\u064E \u0644\u0650\u062D\u064F\u062F\u064F\u0648\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 113, text: "\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 114, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0633\u06E1\u062A\u0650\u063A\u06E1\u0641\u064E\u0627\u0631\u064F \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0644\u0650\u0623\u064E\u0628\u0650\u064A\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0646 \u0645\u0651\u064E\u0648\u06E1\u0639\u0650\u062F\u064E\u0629\u0656 \u0648\u064E\u0639\u064E\u062F\u064E\u0647\u064E\u0627\u0653 \u0625\u0650\u064A\u0651\u064E\u0627\u0647\u064F \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0628\u064E\u0631\u0651\u064E\u0623\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0644\u064E\u0623\u064E\u0648\u0651\u064E\u0640\u0670\u0647\u064C \u062D\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 115, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064F\u0636\u0650\u0644\u0651\u064E \u0642\u064E\u0648\u06E1\u0645\u064E\u06E2\u0627 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0630\u06E1 \u0647\u064E\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 116, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u064A\u064F\u0645\u0650\u064A\u062A\u064F\u06DA \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u0656" }, { id: 117, text: "\u0644\u0651\u064E\u0642\u064E\u062F \u062A\u0651\u064E\u0627\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0647\u064E\u0670\u062C\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u0635\u064E\u0627\u0631\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0647\u064F \u0641\u0650\u064A \u0633\u064E\u0627\u0639\u064E\u0629\u0650 \u0671\u0644\u06E1\u0639\u064F\u0633\u06E1\u0631\u064E\u0629\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u0643\u064E\u0627\u062F\u064E \u064A\u064E\u0632\u0650\u064A\u063A\u064F \u0642\u064F\u0644\u064F\u0648\u0628\u064F \u0641\u064E\u0631\u0650\u064A\u0642\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0627\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0647\u0650\u0645\u06E1 \u0631\u064E\u0621\u064F\u0648\u0641\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 118, text: "\u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u062B\u0651\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064F\u0644\u0651\u0650\u0641\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0636\u064E\u0627\u0642\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0628\u0650\u0645\u064E\u0627 \u0631\u064E\u062D\u064F\u0628\u064E\u062A\u06E1 \u0648\u064E\u0636\u064E\u0627\u0642\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0638\u064E\u0646\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u0644\u0651\u064E\u0627 \u0645\u064E\u0644\u06E1\u062C\u064E\u0623\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0627\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0644\u0650\u064A\u064E\u062A\u064F\u0648\u0628\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u0651\u064E\u0627\u0628\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 119, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 120, text: "\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u0648\u064E\u0645\u064E\u0646\u06E1 \u062D\u064E\u0648\u06E1\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0628\u0650 \u0623\u064E\u0646 \u064A\u064E\u062A\u064E\u062E\u064E\u0644\u0651\u064E\u0641\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u063A\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0635\u0650\u064A\u0628\u064F\u0647\u064F\u0645\u06E1 \u0638\u064E\u0645\u064E\u0623\u065E \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u064E\u0628\u065E \u0648\u064E\u0644\u064E\u0627 \u0645\u064E\u062E\u06E1\u0645\u064E\u0635\u064E\u0629\u065E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0637\u064E\u0640\u0654\u064F\u0648\u0646\u064E \u0645\u064E\u0648\u06E1\u0637\u0650\u0626\u0657\u0627 \u064A\u064E\u063A\u0650\u064A\u0638\u064F \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0646\u064E\u0627\u0644\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u0656 \u0646\u0651\u064E\u064A\u06E1\u0644\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064F\u062A\u0650\u0628\u064E \u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u0645\u064E\u0644\u065E \u0635\u064E\u0670\u0644\u0650\u062D\u064C\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u0636\u0650\u064A\u0639\u064F \u0623\u064E\u062C\u06E1\u0631\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 121, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0646\u064E\u0641\u064E\u0642\u064E\u0629\u0657 \u0635\u064E\u063A\u0650\u064A\u0631\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0642\u06E1\u0637\u064E\u0639\u064F\u0648\u0646\u064E \u0648\u064E\u0627\u062F\u0650\u064A\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064F\u062A\u0650\u0628\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 122, text: "\u06DE\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0644\u0650\u064A\u064E\u0646\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u0627\u0653\u0641\u0651\u064E\u0629\u0657\u06DA \u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0646\u064E\u0641\u064E\u0631\u064E \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0641\u0650\u0631\u06E1\u0642\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0644\u0651\u0650\u064A\u064E\u062A\u064E\u0641\u064E\u0642\u0651\u064E\u0647\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0648\u064E\u0644\u0650\u064A\u064F\u0646\u0630\u0650\u0631\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u062C\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0630\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 123, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u0650 \u0648\u064E\u0644\u06E1\u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u063A\u0650\u0644\u06E1\u0638\u064E\u0629\u0657\u06DA \u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 124, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E\u062A\u06E1 \u0633\u064F\u0648\u0631\u064E\u0629\u065E \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0623\u064E\u064A\u0651\u064F\u0643\u064F\u0645\u06E1 \u0632\u064E\u0627\u062F\u064E\u062A\u06E1\u0647\u064F \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0657\u0627\u06DA \u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0641\u064E\u0632\u064E\u0627\u062F\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0628\u06E1\u0634\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 125, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u065E \u0641\u064E\u0632\u064E\u0627\u062F\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0631\u0650\u062C\u06E1\u0633\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u0650\u062C\u06E1\u0633\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 126, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u0641\u06E1\u062A\u064E\u0646\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0643\u064F\u0644\u0651\u0650 \u0639\u064E\u0627\u0645\u0656 \u0645\u0651\u064E\u0631\u0651\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u0645\u064E\u0631\u0651\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064E\u062A\u064F\u0648\u0628\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 127, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E\u062A\u06E1 \u0633\u064F\u0648\u0631\u064E\u0629\u065E \u0646\u0651\u064E\u0638\u064E\u0631\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u064D \u0647\u064E\u0644\u06E1 \u064A\u064E\u0631\u064E\u0649\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u0656 \u062B\u064F\u0645\u0651\u064E \u0671\u0646\u0635\u064E\u0631\u064E\u0641\u064F\u0648\u0627\u0652\u06DA \u0635\u064E\u0631\u064E\u0641\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064F\u0644\u064F\u0648\u0628\u064E\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 128, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0627 \u0639\u064E\u0646\u0650\u062A\u0651\u064F\u0645\u06E1 \u062D\u064E\u0631\u0650\u064A\u0635\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0631\u064E\u0621\u064F\u0648\u0641\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 129, text: "\u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0642\u064F\u0644\u06E1 \u062D\u064E\u0633\u06E1\u0628\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u062A\u064F\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }] }, { id: 10, name: "\u064A\u0648\u0646\u0633", transliteration: "Yunus", type: "meccan", total_verses: 109, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0631\u06DA \u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u0650" }, { id: 2, text: "\u0623\u064E\u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0639\u064E\u062C\u064E\u0628\u064B\u0627 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u062C\u064F\u0644\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0646\u0630\u0650\u0631\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u062F\u064E\u0645\u064E \u0635\u0650\u062F\u06E1\u0642\u064D \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0633\u064E\u0670\u062D\u0650\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 3, text: "\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0641\u0650\u064A \u0633\u0650\u062A\u0651\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650\u06D6 \u064A\u064F\u062F\u064E\u0628\u0651\u0650\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064E\u06D6 \u0645\u064E\u0627 \u0645\u0650\u0646 \u0634\u064E\u0641\u0650\u064A\u0639\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0625\u0650\u0630\u06E1\u0646\u0650\u0647\u0650\u06E6\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0647\u064F\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627\u06D6 \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0628\u06E1\u062F\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u064E \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0639\u0650\u064A\u062F\u064F\u0647\u064F\u06E5 \u0644\u0650\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0634\u064E\u0631\u064E\u0627\u0628\u065E \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u0645\u0650\u064A\u0645\u0656 \u0648\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0636\u0650\u064A\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E \u0646\u064F\u0648\u0631\u0657\u0627 \u0648\u064E\u0642\u064E\u062F\u0651\u064E\u0631\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646\u064E\u0627\u0632\u0650\u0644\u064E \u0644\u0650\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0639\u064E\u062F\u064E\u062F\u064E \u0671\u0644\u0633\u0651\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u064E\u06DA \u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u064A\u064F\u0641\u064E\u0635\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0671\u062E\u06E1\u062A\u0650\u0644\u064E\u0670\u0641\u0650 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0648\u064E\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0637\u06E1\u0645\u064E\u0623\u064E\u0646\u0651\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u063A\u064E\u0670\u0641\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645 \u0628\u0650\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1\u06D6 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u0639\u0650\u064A\u0645\u0650" }, { id: 10, text: "\u062F\u064E\u0639\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u0645\u0651\u064E \u0648\u064E\u062A\u064E\u062D\u0650\u064A\u0651\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0633\u064E\u0644\u064E\u0670\u0645\u065E\u06DA \u0648\u064E\u0621\u064E\u0627\u062E\u0650\u0631\u064F \u062F\u064E\u0639\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u06DE\u0648\u064E\u0644\u064E\u0648\u06E1 \u064A\u064F\u0639\u064E\u062C\u0651\u0650\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0671\u0644\u0634\u0651\u064E\u0631\u0651\u064E \u0671\u0633\u06E1\u062A\u0650\u0639\u06E1\u062C\u064E\u0627\u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650 \u0644\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u062C\u064E\u0644\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0646\u064E\u0630\u064E\u0631\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0641\u0650\u064A \u0637\u064F\u063A\u06E1\u064A\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0645\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0671\u0644\u0636\u0651\u064F\u0631\u0651\u064F \u062F\u064E\u0639\u064E\u0627\u0646\u064E\u0627 \u0644\u0650\u062C\u064E\u0646\u06E2\u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u06E1 \u0642\u064E\u0627\u0639\u0650\u062F\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u0657\u0627 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0634\u064E\u0641\u06E1\u0646\u064E\u0627 \u0639\u064E\u0646\u06E1\u0647\u064F \u0636\u064F\u0631\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0631\u0651\u064E \u0643\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062F\u06E1\u0639\u064F\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0636\u064F\u0631\u0651\u0656 \u0645\u0651\u064E\u0633\u0651\u064E\u0647\u064F\u06E5\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0632\u064F\u064A\u0651\u0650\u0646\u064E \u0644\u0650\u0644\u06E1\u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u0650\u064A\u0646\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0645\u0651\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u062E\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0641\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0644\u0650\u0646\u064E\u0646\u0638\u064F\u0631\u064E \u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0627\u062A\u064F\u0646\u064E\u0627 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0671\u0626\u06E1\u062A\u0650 \u0628\u0650\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064D \u063A\u064E\u064A\u06E1\u0631\u0650 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0628\u064E\u062F\u0651\u0650\u0644\u06E1\u0647\u064F\u06DA \u0642\u064F\u0644\u06E1 \u0645\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u062A\u0650\u0644\u06E1\u0642\u064E\u0627\u0653\u064A\u0655\u0650 \u0646\u064E\u0641\u06E1\u0633\u0650\u064A\u0653\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u0651\u064E\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0625\u0650\u0646\u06E1 \u0639\u064E\u0635\u064E\u064A\u06E1\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 16, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u062A\u064E\u0644\u064E\u0648\u06E1\u062A\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0644\u064E\u0628\u0650\u062B\u06E1\u062A\u064F \u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u0639\u064F\u0645\u064F\u0631\u0657\u0627 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0641\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0634\u064F\u0641\u064E\u0639\u064E\u0640\u0670\u0653\u0624\u064F\u0646\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0642\u064F\u0644\u06E1 \u0623\u064E\u062A\u064F\u0646\u064E\u0628\u0651\u0650\u0640\u0654\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649\u0670 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0641\u064E\u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u065E \u0633\u064E\u0628\u064E\u0642\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0645\u064E\u0627 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u064A\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0671\u0646\u062A\u064E\u0638\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064E\u0639\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u062A\u064E\u0638\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0630\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0636\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0633\u0651\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0643\u06E1\u0631\u065E \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0627\u062A\u0650\u0646\u064E\u0627\u06DA \u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0633\u06E1\u0631\u064E\u0639\u064F \u0645\u064E\u0643\u06E1\u0631\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064F\u0633\u064F\u0644\u064E\u0646\u064E\u0627 \u064A\u064E\u0643\u06E1\u062A\u064F\u0628\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u062A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0633\u064E\u064A\u0651\u0650\u0631\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u0648\u064E\u062C\u064E\u0631\u064E\u064A\u06E1\u0646\u064E \u0628\u0650\u0647\u0650\u0645 \u0628\u0650\u0631\u0650\u064A\u062D\u0656 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0629\u0656 \u0648\u064E\u0641\u064E\u0631\u0650\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064E\u0627 \u0631\u0650\u064A\u062D\u064C \u0639\u064E\u0627\u0635\u0650\u0641\u065E \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062C\u064F \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u0643\u064E\u0627\u0646\u0656 \u0648\u064E\u0638\u064E\u0646\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064F\u062D\u0650\u064A\u0637\u064E \u0628\u0650\u0647\u0650\u0645\u06E1 \u062F\u064E\u0639\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u0650\u064A\u0646\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E \u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u062A\u064E\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0644\u064E\u0646\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 23, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u062C\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D7 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0628\u064E\u063A\u06E1\u064A\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06D6 \u0645\u0651\u064E\u062A\u064E\u0670\u0639\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0646\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0643\u064E\u0645\u064E\u0627\u0653\u0621\u064D \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0641\u064E\u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0637\u064E \u0628\u0650\u0647\u0650\u06E6 \u0646\u064E\u0628\u064E\u0627\u062A\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u064F \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u062E\u064E\u0630\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0632\u064F\u062E\u06E1\u0631\u064F\u0641\u064E\u0647\u064E\u0627 \u0648\u064E\u0671\u0632\u0651\u064E\u064A\u0651\u064E\u0646\u064E\u062A\u06E1 \u0648\u064E\u0638\u064E\u0646\u0651\u064E \u0623\u064E\u0647\u06E1\u0644\u064F\u0647\u064E\u0627\u0653 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0670\u062F\u0650\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0631\u064F\u0646\u064E\u0627 \u0644\u064E\u064A\u06E1\u0644\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0646\u064E\u0647\u064E\u0627\u0631\u0657\u0627 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u062D\u064E\u0635\u0650\u064A\u062F\u0657\u0627 \u0643\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u063A\u06E1\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0633\u0650\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u0641\u064E\u0635\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u062F\u064E\u0627\u0631\u0650 \u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0670\u0645\u0650 \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 26, text: "\u06DE\u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670 \u0648\u064E\u0632\u0650\u064A\u064E\u0627\u062F\u064E\u0629\u065E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u0647\u064E\u0642\u064F \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u062A\u064E\u0631\u065E \u0648\u064E\u0644\u064E\u0627 \u0630\u0650\u0644\u0651\u064E\u0629\u064C\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0650\u06ED \u0628\u0650\u0645\u0650\u062B\u06E1\u0644\u0650\u0647\u064E\u0627 \u0648\u064E\u062A\u064E\u0631\u06E1\u0647\u064E\u0642\u064F\u0647\u064F\u0645\u06E1 \u0630\u0650\u0644\u0651\u064E\u0629\u065E\u06D6 \u0645\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0639\u064E\u0627\u0635\u0650\u0645\u0656\u06D6 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u063A\u06E1\u0634\u0650\u064A\u064E\u062A\u06E1 \u0648\u064F\u062C\u064F\u0648\u0647\u064F\u0647\u064F\u0645\u06E1 \u0642\u0650\u0637\u064E\u0639\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0645\u064F\u0638\u06E1\u0644\u0650\u0645\u064B\u0627\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u062D\u06E1\u0634\u064F\u0631\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0646\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0627\u0652 \u0645\u064E\u0643\u064E\u0627\u0646\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0648\u064E\u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1\u06DA \u0641\u064E\u0632\u064E\u064A\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u064A\u0651\u064E\u0627\u0646\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0641\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u0647\u0650\u064A\u062F\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E\u0627 \u0639\u064E\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u063A\u064E\u0670\u0641\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0647\u064F\u0646\u064E\u0627\u0644\u0650\u0643\u064E \u062A\u064E\u0628\u06E1\u0644\u064F\u0648\u0627\u0652 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0644\u064E\u0641\u064E\u062A\u06E1\u06DA \u0648\u064E\u0631\u064F\u062F\u0651\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u0648\u064E\u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646 \u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0645\u0651\u064E\u0646 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064E \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u064A\u0651\u0650\u062A\u0650 \u0648\u064E\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u0651\u0650\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u0650 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u062F\u064E\u0628\u0651\u0650\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064E\u06DA \u0641\u064E\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0641\u064E\u0642\u064F\u0644\u06E1 \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u0641\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06D6 \u0641\u064E\u0645\u064E\u0627\u0630\u064E\u0627 \u0628\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0636\u0651\u064E\u0644\u064E\u0670\u0644\u064F\u06D6 \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u062A\u064F\u0635\u06E1\u0631\u064E\u0641\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062D\u064E\u0642\u0651\u064E\u062A\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u064E\u0633\u064E\u0642\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0642\u064F\u0644\u06E1 \u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0628\u06E1\u062F\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u064E \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0639\u0650\u064A\u062F\u064F\u0647\u064F\u06E5\u06DA \u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0628\u06E1\u062F\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u064E \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0639\u0650\u064A\u062F\u064F\u0647\u064F\u06E5\u06D6 \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u062A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0642\u064F\u0644\u06E1 \u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0644\u0650\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D7 \u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0623\u064E\u062D\u064E\u0642\u0651\u064F \u0623\u064E\u0646 \u064A\u064F\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0623\u064E\u0645\u0651\u064E\u0646 \u0644\u0651\u064E\u0627 \u064A\u064E\u0647\u0650\u062F\u0651\u0650\u064A\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u0647\u06E1\u062F\u064E\u0649\u0670\u06D6 \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0638\u064E\u0646\u0651\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0638\u0651\u064E\u0646\u0651\u064E \u0644\u064E\u0627 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064F \u0623\u064E\u0646 \u064A\u064F\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u062A\u064E\u0635\u06E1\u062F\u0650\u064A\u0642\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u062A\u064E\u0641\u06E1\u0635\u0650\u064A\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F\u06D6 \u0642\u064F\u0644\u06E1 \u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0633\u064F\u0648\u0631\u064E\u0629\u0656 \u0645\u0651\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0639\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 39, text: "\u0628\u064E\u0644\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064F\u062D\u0650\u064A\u0637\u064F\u0648\u0627\u0652 \u0628\u0650\u0639\u0650\u0644\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u0647\u0650\u0645\u06E1 \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u064F\u0647\u064F\u06E5\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 40, text: "\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0643\u064E \u0641\u064E\u0642\u064F\u0644 \u0644\u0651\u0650\u064A \u0639\u064E\u0645\u064E\u0644\u0650\u064A \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0645\u064E\u0644\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u064E\u0631\u0650\u064A\u0653\u0640\u0654\u064F\u0648\u0646\u064E \u0645\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0645\u064E\u0644\u064F \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0628\u064E\u0631\u0650\u064A\u0653\u0621\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06DA \u0623\u064E\u0641\u064E\u0623\u064E\u0646\u062A\u064E \u062A\u064F\u0633\u06E1\u0645\u0650\u0639\u064F \u0671\u0644\u0635\u0651\u064F\u0645\u0651\u064E \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0646\u0638\u064F\u0631\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06DA \u0623\u064E\u0641\u064E\u0623\u064E\u0646\u062A\u064E \u062A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0639\u064F\u0645\u06E1\u064A\u064E \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u062D\u06E1\u0634\u064F\u0631\u064F\u0647\u064F\u0645\u06E1 \u0643\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0644\u06E1\u0628\u064E\u062B\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u064E\u0627\u0639\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u064A\u064E\u062A\u064E\u0639\u064E\u0627\u0631\u064E\u0641\u064F\u0648\u0646\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0642\u064E\u062F\u06E1 \u062E\u064E\u0633\u0650\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0644\u0650\u0642\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u0646\u064F\u0631\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0628\u064E\u0639\u06E1\u0636\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0646\u064E\u0639\u0650\u062F\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0646\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0641\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0647\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0634\u064E\u0647\u0650\u064A\u062F\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u065E\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u0645\u06E1 \u0642\u064F\u0636\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u062A\u064E\u0649\u0670 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0648\u064E\u0639\u06E1\u062F\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 49, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u064A \u0636\u064E\u0631\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0641\u06E1\u0639\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u064D \u0623\u064E\u062C\u064E\u0644\u064C\u06DA \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u062C\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u062E\u0650\u0631\u064F\u0648\u0646\u064E \u0633\u064E\u0627\u0639\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0642\u06E1\u062F\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062A\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064F\u0647\u064F\u06E5 \u0628\u064E\u064A\u064E\u0670\u062A\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0646\u064E\u0647\u064E\u0627\u0631\u0657\u0627 \u0645\u0651\u064E\u0627\u0630\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F \u0645\u0650\u0646\u06E1\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0623\u064E\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627 \u0648\u064E\u0642\u064E\u0639\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u0653\u06DA \u0621\u064E\u0627\u0653\u0644\u06E1\u0640\u0654\u064E\u0670\u0646\u064E \u0648\u064E\u0642\u064E\u062F\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u062B\u064F\u0645\u0651\u064E \u0642\u0650\u064A\u0644\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062E\u064F\u0644\u06E1\u062F\u0650 \u0647\u064E\u0644\u06E1 \u062A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u06DE\u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u0646\u06E2\u0628\u0650\u0640\u0654\u064F\u0648\u0646\u064E\u0643\u064E \u0623\u064E\u062D\u064E\u0642\u0651\u064C \u0647\u064F\u0648\u064E\u06D6 \u0642\u064F\u0644\u06E1 \u0625\u0650\u064A \u0648\u064E\u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u062D\u064E\u0642\u0651\u065E\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0646\u064E\u0641\u06E1\u0633\u0656 \u0638\u064E\u0644\u064E\u0645\u064E\u062A\u06E1 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0644\u064E\u0671\u0641\u06E1\u062A\u064E\u062F\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0623\u064E\u0633\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u062F\u064E\u0627\u0645\u064E\u0629\u064E \u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E\u06D6 \u0648\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u065E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0647\u064F\u0648\u064E \u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u064A\u064F\u0645\u0650\u064A\u062A\u064F \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0643\u064F\u0645 \u0645\u0651\u064E\u0648\u06E1\u0639\u0650\u0638\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0634\u0650\u0641\u064E\u0627\u0653\u0621\u065E \u0644\u0651\u0650\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 58, text: "\u0642\u064F\u0644\u06E1 \u0628\u0650\u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6 \u0641\u064E\u0628\u0650\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0644\u06E1\u064A\u064E\u0641\u06E1\u0631\u064E\u062D\u064F\u0648\u0627\u0652 \u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u0650\u0632\u06E1\u0642\u0656 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u062D\u064E\u0631\u064E\u0627\u0645\u0657\u0627 \u0648\u064E\u062D\u064E\u0644\u064E\u0670\u0644\u0657\u0627 \u0642\u064F\u0644\u06E1 \u0621\u064E\u0627\u0653\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0630\u0650\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0623\u064E\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0648\u064E\u0645\u064E\u0627 \u0638\u064E\u0646\u0651\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0630\u064F\u0648 \u0641\u064E\u0636\u06E1\u0644\u064D \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 61, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0641\u0650\u064A \u0634\u064E\u0623\u06E1\u0646\u0656 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F \u0645\u0650\u0646 \u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0656 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1 \u0639\u064E\u0645\u064E\u0644\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0634\u064F\u0647\u064F\u0648\u062F\u064B\u0627 \u0625\u0650\u0630\u06E1 \u062A\u064F\u0641\u0650\u064A\u0636\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0632\u064F\u0628\u064F \u0639\u064E\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0645\u0650\u0646 \u0645\u0651\u0650\u062B\u06E1\u0642\u064E\u0627\u0644\u0650 \u0630\u064E\u0631\u0651\u064E\u0629\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u063A\u064E\u0631\u064E \u0645\u0650\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 62, text: "\u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06DA \u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u062F\u0650\u064A\u0644\u064E \u0644\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 65, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0632\u064F\u0646\u0643\u064E \u0642\u064E\u0648\u06E1\u0644\u064F\u0647\u064F\u0645\u06E1\u06D8 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0639\u0650\u0632\u0651\u064E\u0629\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627\u06DA \u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 66, text: "\u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E\u06DA \u0625\u0650\u0646 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0638\u0651\u064E\u0646\u0651\u064E \u0648\u064E\u0625\u0650\u0646\u06E1 \u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u064A\u064E\u062E\u06E1\u0631\u064F\u0635\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0644\u0650\u062A\u064E\u0633\u06E1\u0643\u064F\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0645\u064F\u0628\u06E1\u0635\u0650\u0631\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u062F\u0657\u0627\u06D7 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5\u06D6 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0646\u0650\u064A\u0651\u064F\u06D6 \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0625\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0650\u06ED \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627\u0653\u06DA \u0623\u064E\u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E \u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0645\u064E\u062A\u064E\u0670\u0639\u065E \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0647\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0646\u064F\u0630\u0650\u064A\u0642\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u0634\u0651\u064E\u062F\u0650\u064A\u062F\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u06DE\u0648\u064E\u0671\u062A\u06E1\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0646\u064E\u0628\u064E\u0623\u064E \u0646\u064F\u0648\u062D\u064D \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0643\u064E\u0628\u064F\u0631\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u064E\u0642\u064E\u0627\u0645\u0650\u064A \u0648\u064E\u062A\u064E\u0630\u06E1\u0643\u0650\u064A\u0631\u0650\u064A \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u062A\u064F \u0641\u064E\u0623\u064E\u062C\u06E1\u0645\u0650\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0631\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064E\u0643\u064F\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u063A\u064F\u0645\u0651\u064E\u0629\u0657 \u062B\u064F\u0645\u0651\u064E \u0671\u0642\u06E1\u0636\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0646\u0638\u0650\u0631\u064F\u0648\u0646\u0650" }, { id: 72, text: "\u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0645\u064E\u0627 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064D\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 73, text: "\u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F \u0641\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0645\u064E\u0646 \u0645\u0651\u064E\u0639\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u062E\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0641\u064E \u0648\u064E\u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u06D6 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u0630\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 74, text: "\u062B\u064F\u0645\u0651\u064E \u0628\u064E\u0639\u064E\u062B\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0631\u064F\u0633\u064F\u0644\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u0637\u06E1\u0628\u064E\u0639\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0639\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 75, text: "\u062B\u064F\u0645\u0651\u064E \u0628\u064E\u0639\u064E\u062B\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0645\u064E\u0644\u064E\u0625\u0650\u064A\u0652\u0647\u0650\u06E6 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0645\u0651\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 76, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0646\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 77, text: "\u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0623\u064E\u0633\u0650\u062D\u06E1\u0631\u064C \u0647\u064E\u0670\u0630\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F \u0671\u0644\u0633\u0651\u064E\u0640\u0670\u062D\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 78, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062C\u0650\u0626\u06E1\u062A\u064E\u0646\u064E\u0627 \u0644\u0650\u062A\u064E\u0644\u06E1\u0641\u0650\u062A\u064E\u0646\u064E\u0627 \u0639\u064E\u0645\u0651\u064E\u0627 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0648\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u064E\u0627 \u0671\u0644\u06E1\u0643\u0650\u0628\u06E1\u0631\u0650\u064A\u064E\u0627\u0653\u0621\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0644\u064E\u0643\u064F\u0645\u064E\u0627 \u0628\u0650\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 79, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0671\u0626\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0633\u064E\u0670\u062D\u0650\u0631\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 80, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0631\u064E\u0629\u064F \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0644\u06E1\u0642\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0644\u06E1\u0642\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0644\u06E1\u0642\u064E\u0648\u06E1\u0627\u0652 \u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0645\u064E\u0627 \u062C\u0650\u0626\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650 \u0671\u0644\u0633\u0651\u0650\u062D\u06E1\u0631\u064F\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u064A\u064F\u0628\u06E1\u0637\u0650\u0644\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u0635\u06E1\u0644\u0650\u062D\u064F \u0639\u064E\u0645\u064E\u0644\u064E \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 82, text: "\u0648\u064E\u064A\u064F\u062D\u0650\u0642\u0651\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0628\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0631\u0650\u0647\u064E \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0641\u064E\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0644\u0650\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u064E\u0649\u0670 \u062E\u064E\u0648\u06E1\u0641\u0656 \u0645\u0651\u0650\u0646 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0645\u064E\u0644\u064E\u0625\u0650\u064A\u0652\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u0641\u06E1\u062A\u0650\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0644\u064E\u0639\u064E\u0627\u0644\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 84, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 85, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 86, text: "\u0648\u064E\u0646\u064E\u062C\u0651\u0650\u0646\u064E\u0627 \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 87, text: "\u0648\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u0623\u064E\u0646 \u062A\u064E\u0628\u064E\u0648\u0651\u064E\u0621\u064E\u0627 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0643\u064F\u0645\u064E\u0627 \u0628\u0650\u0645\u0650\u0635\u06E1\u0631\u064E \u0628\u064F\u064A\u064F\u0648\u062A\u0657\u0627 \u0648\u064E\u0671\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0628\u064F\u064A\u064F\u0648\u062A\u064E\u0643\u064F\u0645\u06E1 \u0642\u0650\u0628\u06E1\u0644\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E\u06D7 \u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 88, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0645\u064E\u0644\u064E\u0623\u064E\u0647\u064F\u06E5 \u0632\u0650\u064A\u0646\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u0650\u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0643\u064E\u06D6 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0671\u0637\u06E1\u0645\u0650\u0633\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0671\u0634\u06E1\u062F\u064F\u062F\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0631\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u0623\u064E\u0644\u0650\u064A\u0645\u064E" }, { id: 89, text: "\u0642\u064E\u0627\u0644\u064E \u0642\u064E\u062F\u06E1 \u0623\u064F\u062C\u0650\u064A\u0628\u064E\u062A \u062F\u0651\u064E\u0639\u06E1\u0648\u064E\u062A\u064F\u0643\u064F\u0645\u064E\u0627 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064E\u0627\u0653\u0646\u0651\u0650 \u0633\u064E\u0628\u0650\u064A\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 90, text: "\u06DE\u0648\u064E\u062C\u064E\u0670\u0648\u064E\u0632\u06E1\u0646\u064E\u0627 \u0628\u0650\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E \u0641\u064E\u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u064F\u0647\u064F\u06E5 \u0628\u064E\u063A\u06E1\u064A\u0657\u0627 \u0648\u064E\u0639\u064E\u062F\u06E1\u0648\u064B\u0627\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0643\u064E\u0647\u064F \u0671\u0644\u06E1\u063A\u064E\u0631\u064E\u0642\u064F \u0642\u064E\u0627\u0644\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0628\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 91, text: "\u0621\u064E\u0627\u0653\u0644\u06E1\u0640\u0654\u064E\u0670\u0646\u064E \u0648\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0635\u064E\u064A\u06E1\u062A\u064E \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 92, text: "\u0641\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064F\u0646\u064E\u062C\u0651\u0650\u064A\u0643\u064E \u0628\u0650\u0628\u064E\u062F\u064E\u0646\u0650\u0643\u064E \u0644\u0650\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u0650\u0645\u064E\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u064E\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0629\u0657\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0639\u064E\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0644\u064E\u063A\u064E\u0670\u0641\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 93, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0628\u064E\u0648\u0651\u064E\u0623\u06E1\u0646\u064E\u0627 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0645\u064F\u0628\u064E\u0648\u0651\u064E\u0623\u064E \u0635\u0650\u062F\u06E1\u0642\u0656 \u0648\u064E\u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0641\u064E\u0645\u064E\u0627 \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u064A\u064E\u0642\u06E1\u0636\u0650\u064A \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0641\u0650\u064A\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 94, text: "\u0641\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0641\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0642\u06E1\u0631\u064E\u0621\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E\u06DA \u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0645\u06E1\u062A\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 95, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 96, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062D\u064E\u0642\u0651\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0643\u064F\u0644\u0651\u064F \u0621\u064E\u0627\u064A\u064E\u0629\u064D \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0631\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u0623\u064E\u0644\u0650\u064A\u0645\u064E" }, { id: 98, text: "\u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064C \u0621\u064E\u0627\u0645\u064E\u0646\u064E\u062A\u06E1 \u0641\u064E\u0646\u064E\u0641\u064E\u0639\u064E\u0647\u064E\u0627\u0653 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064F\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0648\u0646\u064F\u0633\u064E \u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0634\u064E\u0641\u06E1\u0646\u064E\u0627 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062E\u0650\u0632\u06E1\u064A\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 99, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0644\u064E\u0623\u0653\u0645\u064E\u0646\u064E \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0643\u064F\u0644\u0651\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627\u06DA \u0623\u064E\u0641\u064E\u0623\u064E\u0646\u062A\u064E \u062A\u064F\u0643\u06E1\u0631\u0650\u0647\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 100, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u064D \u0623\u064E\u0646 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0671\u0644\u0631\u0651\u0650\u062C\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 101, text: "\u0642\u064F\u0644\u0650 \u0671\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0630\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u063A\u06E1\u0646\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u064F \u0648\u064E\u0671\u0644\u0646\u0651\u064F\u0630\u064F\u0631\u064F \u0639\u064E\u0646 \u0642\u064E\u0648\u06E1\u0645\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 102, text: "\u0641\u064E\u0647\u064E\u0644\u06E1 \u064A\u064E\u0646\u062A\u064E\u0638\u0650\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u062B\u06E1\u0644\u064E \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0644\u064E\u0648\u06E1\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0642\u064F\u0644\u06E1 \u0641\u064E\u0671\u0646\u062A\u064E\u0638\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064E\u0639\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u062A\u064E\u0638\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 103, text: "\u062B\u064F\u0645\u0651\u064E \u0646\u064F\u0646\u064E\u062C\u0651\u0650\u064A \u0631\u064F\u0633\u064F\u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062D\u064E\u0642\u0651\u064B\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0646\u064F\u0646\u062C\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 104, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0646 \u062F\u0650\u064A\u0646\u0650\u064A \u0641\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 105, text: "\u0648\u064E\u0623\u064E\u0646\u06E1 \u0623\u064E\u0642\u0650\u0645\u06E1 \u0648\u064E\u062C\u06E1\u0647\u064E\u0643\u064E \u0644\u0650\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u062D\u064E\u0646\u0650\u064A\u0641\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 106, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F\u0643\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0643\u064E\u06D6 \u0641\u064E\u0625\u0650\u0646 \u0641\u064E\u0639\u064E\u0644\u06E1\u062A\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0625\u0650\u0630\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 107, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0645\u06E1\u0633\u064E\u0633\u06E1\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0636\u064F\u0631\u0651\u0656 \u0641\u064E\u0644\u064E\u0627 \u0643\u064E\u0627\u0634\u0650\u0641\u064E \u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064F\u0631\u0650\u062F\u06E1\u0643\u064E \u0628\u0650\u062E\u064E\u064A\u06E1\u0631\u0656 \u0641\u064E\u0644\u064E\u0627 \u0631\u064E\u0627\u0653\u062F\u0651\u064E \u0644\u0650\u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u06DA \u064A\u064F\u0635\u0650\u064A\u0628\u064F \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 108, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0649\u0670 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u0650\u064A \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0636\u064E\u0644\u0651\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0636\u0650\u0644\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0628\u0650\u0648\u064E\u0643\u0650\u064A\u0644\u0656" }, { id: 109, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u062D\u064E\u0670\u0643\u0650\u0645\u0650\u064A\u0646\u064E" }] }, { id: 11, name: "\u0647\u0648\u062F", transliteration: "Hud", type: "meccan", total_verses: 123, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0631\u06DA \u0643\u0650\u062A\u064E\u0670\u0628\u064C \u0623\u064F\u062D\u06E1\u0643\u0650\u0645\u064E\u062A\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u0641\u064F\u0635\u0651\u0650\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u06E1 \u062D\u064E\u0643\u0650\u064A\u0645\u064D \u062E\u064E\u0628\u0650\u064A\u0631\u064D" }, { id: 2, text: "\u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0646\u0650\u064A \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0648\u064E\u0628\u064E\u0634\u0650\u064A\u0631\u065E" }, { id: 3, text: "\u0648\u064E\u0623\u064E\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u062A\u064F\u0648\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064F\u0645\u064E\u062A\u0651\u0650\u0639\u06E1\u0643\u064F\u0645 \u0645\u0651\u064E\u062A\u064E\u0670\u0639\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649 \u0648\u064E\u064A\u064F\u0624\u06E1\u062A\u0650 \u0643\u064F\u0644\u0651\u064E \u0630\u0650\u064A \u0641\u064E\u0636\u06E1\u0644\u0656 \u0641\u064E\u0636\u06E1\u0644\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u0656 \u0643\u064E\u0628\u0650\u064A\u0631\u064D" }, { id: 4, text: "\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 5, text: "\u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062B\u06E1\u0646\u064F\u0648\u0646\u064E \u0635\u064F\u062F\u064F\u0648\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0641\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u06DA \u0623\u064E\u0644\u064E\u0627 \u062D\u0650\u064A\u0646\u064E \u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0634\u064F\u0648\u0646\u064E \u062B\u0650\u064A\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u064A\u064F\u0633\u0650\u0631\u0651\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0639\u06E1\u0644\u0650\u0646\u064F\u0648\u0646\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 6, text: "\u06DE\u0648\u064E\u0645\u064E\u0627 \u0645\u0650\u0646 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0631\u0650\u0632\u06E1\u0642\u064F\u0647\u064E\u0627 \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u064E\u0647\u064E\u0627 \u0648\u064E\u0645\u064F\u0633\u06E1\u062A\u064E\u0648\u06E1\u062F\u064E\u0639\u064E\u0647\u064E\u0627\u06DA \u0643\u064F\u0644\u0651\u065E \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 7, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0641\u0650\u064A \u0633\u0650\u062A\u0651\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0631\u06E1\u0634\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u0650 \u0644\u0650\u064A\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u0651\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0639\u064E\u0645\u064E\u0644\u0657\u0627\u06D7 \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0642\u064F\u0644\u06E1\u062A\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0628\u06E1\u0639\u064F\u0648\u062B\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650 \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 8, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u062E\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u0645\u0651\u064E\u0639\u06E1\u062F\u064F\u0648\u062F\u064E\u0629\u0656 \u0644\u0651\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0646\u0651\u064E \u0645\u064E\u0627 \u064A\u064E\u062D\u06E1\u0628\u0650\u0633\u064F\u0647\u064F\u06E5\u0653\u06D7 \u0623\u064E\u0644\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645\u06E1 \u0644\u064E\u064A\u06E1\u0633\u064E \u0645\u064E\u0635\u06E1\u0631\u064F\u0648\u0641\u064B\u0627 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u062D\u064E\u0627\u0642\u064E \u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0630\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0645\u0650\u0646\u0651\u064E\u0627 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u062B\u064F\u0645\u0651\u064E \u0646\u064E\u0632\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u064A\u064E\u0640\u0654\u064F\u0648\u0633\u065E \u0643\u064E\u0641\u064F\u0648\u0631\u065E" }, { id: 10, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0630\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0646\u064E\u0639\u06E1\u0645\u064E\u0627\u0653\u0621\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0636\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0633\u0651\u064E\u062A\u06E1\u0647\u064F \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064E\u0646\u0651\u064E \u0630\u064E\u0647\u064E\u0628\u064E \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u064F \u0639\u064E\u0646\u0651\u0650\u064A\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0641\u064E\u0631\u0650\u062D\u065E \u0641\u064E\u062E\u064F\u0648\u0631\u064C" }, { id: 11, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0623\u064E\u062C\u06E1\u0631\u065E \u0643\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 12, text: "\u0641\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064E \u062A\u064E\u0627\u0631\u0650\u0643\u064F\u06E2 \u0628\u064E\u0639\u06E1\u0636\u064E \u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0636\u064E\u0627\u0653\u0626\u0650\u0642\u064F\u06E2 \u0628\u0650\u0647\u0650\u06E6 \u0635\u064E\u062F\u06E1\u0631\u064F\u0643\u064E \u0623\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0643\u064E\u0646\u0632\u064C \u0623\u064E\u0648\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0645\u064E\u0644\u064E\u0643\u064C\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0646\u064E\u0630\u0650\u064A\u0631\u065E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0643\u0650\u064A\u0644\u064C" }, { id: 13, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F\u06D6 \u0642\u064F\u0644\u06E1 \u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0639\u064E\u0634\u06E1\u0631\u0650 \u0633\u064F\u0648\u064E\u0631\u0656 \u0645\u0651\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0645\u064F\u0641\u06E1\u062A\u064E\u0631\u064E\u064A\u064E\u0670\u062A\u0656 \u0648\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0639\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0641\u064E\u0625\u0650\u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0628\u0650\u0639\u0650\u0644\u06E1\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0632\u0650\u064A\u0646\u064E\u062A\u064E\u0647\u064E\u0627 \u0646\u064F\u0648\u064E\u0641\u0651\u0650 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064E\u0627 \u064A\u064F\u0628\u06E1\u062E\u064E\u0633\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F\u06D6 \u0648\u064E\u062D\u064E\u0628\u0650\u0637\u064E \u0645\u064E\u0627 \u0635\u064E\u0646\u064E\u0639\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0628\u064E\u0670\u0637\u0650\u0644\u065E \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0647\u064F \u0634\u064E\u0627\u0647\u0650\u062F\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0643\u0650\u062A\u064E\u0670\u0628\u064F \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0645\u064E\u0627\u0645\u0657\u0627 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u064B\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u0650 \u0641\u064E\u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0645\u064E\u0648\u06E1\u0639\u0650\u062F\u064F\u0647\u064F\u06E5\u06DA \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F \u0641\u0650\u064A \u0645\u0650\u0631\u06E1\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u064B\u0627\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064F\u0639\u06E1\u0631\u064E\u0636\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u06E1\u0623\u064E\u0634\u06E1\u0647\u064E\u0670\u062F\u064F \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u064E\u0628\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06DA \u0623\u064E\u0644\u064E\u0627 \u0644\u064E\u0639\u06E1\u0646\u064E\u0629\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 19, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0639\u0650\u0648\u064E\u062C\u0657\u0627 \u0648\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0647\u064F\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E\u06D8 \u064A\u064F\u0636\u064E\u0670\u0639\u064E\u0641\u064F \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F\u06DA \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u064E \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0633\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0644\u064E\u0627 \u062C\u064E\u0631\u064E\u0645\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u062E\u06E1\u0633\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0648\u064E\u0623\u064E\u062E\u06E1\u0628\u064E\u062A\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u06DE\u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u06E1\u0641\u064E\u0631\u0650\u064A\u0642\u064E\u064A\u06E1\u0646\u0650 \u0643\u064E\u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0635\u064E\u0645\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0635\u0650\u064A\u0631\u0650 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u0650\u06DA \u0647\u064E\u0644\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A\u064E\u0627\u0646\u0650 \u0645\u064E\u062B\u064E\u0644\u064B\u0627\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0646\u064F\u0648\u062D\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645\u06E1 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 26, text: "\u0623\u064E\u0646 \u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 27, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u0646\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u0657\u0627 \u0645\u0651\u0650\u062B\u06E1\u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0623\u064E\u0631\u064E\u0627\u0630\u0650\u0644\u064F\u0646\u064E\u0627 \u0628\u064E\u0627\u062F\u0650\u064A\u064E \u0671\u0644\u0631\u0651\u064E\u0623\u06E1\u064A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u0631\u064E\u0649\u0670 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u06ED \u0628\u064E\u0644\u06E1 \u0646\u064E\u0638\u064F\u0646\u0651\u064F\u0643\u064F\u0645\u06E1 \u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0646\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0647\u0650\u06E6 \u0641\u064E\u0639\u064F\u0645\u0651\u0650\u064A\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u064F\u0644\u06E1\u0632\u0650\u0645\u064F\u0643\u064F\u0645\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064E\u0627 \u0643\u064E\u0670\u0631\u0650\u0647\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0648\u064E\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0627\u0644\u064B\u0627\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0628\u0650\u0637\u064E\u0627\u0631\u0650\u062F\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0644\u064E\u0670\u0642\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0631\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u062A\u064E\u062C\u06E1\u0647\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0648\u064E\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0645\u064E\u0646 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u0637\u064E\u0631\u064E\u062F\u062A\u0651\u064F\u0647\u064F\u0645\u06E1\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u0650\u064A \u062E\u064E\u0632\u064E\u0627\u0653\u0626\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0642\u064F\u0648\u0644\u064F \u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064E\u0644\u064E\u0643\u065E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0632\u06E1\u062F\u064E\u0631\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u064F\u0643\u064F\u0645\u06E1 \u0644\u064E\u0646 \u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u064A\u06E1\u0631\u064B\u0627\u06D6 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0646\u064F\u0648\u062D\u064F \u0642\u064E\u062F\u06E1 \u062C\u064E\u0670\u062F\u064E\u0644\u06E1\u062A\u064E\u0646\u064E\u0627 \u0641\u064E\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u06E1\u062A\u064E \u062C\u0650\u062F\u064E\u0670\u0644\u064E\u0646\u064E\u0627 \u0641\u064E\u0623\u06E1\u062A\u0650\u0646\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u0650\u062F\u064F\u0646\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0643\u064F\u0645 \u0628\u0650\u0647\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F\u0643\u064F\u0645\u06E1 \u0646\u064F\u0635\u06E1\u062D\u0650\u064A\u0653 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u062F\u062A\u0651\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0646\u0635\u064E\u062D\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u064A\u064F\u063A\u06E1\u0648\u0650\u064A\u064E\u0643\u064F\u0645\u06E1\u06DA \u0647\u064F\u0648\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F\u06D6 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u064A\u06E1\u062A\u064F\u0647\u064F\u06E5 \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0625\u0650\u062C\u06E1\u0631\u064E\u0627\u0645\u0650\u064A \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0628\u064E\u0631\u0650\u064A\u0653\u0621\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0648\u064E\u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0646\u064F\u0648\u062D\u064D \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u062A\u064E\u0626\u0650\u0633\u06E1 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0648\u064E\u0671\u0635\u06E1\u0646\u064E\u0639\u0650 \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064E \u0628\u0650\u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0650\u0646\u064E\u0627 \u0648\u064E\u0648\u064E\u062D\u06E1\u064A\u0650\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062E\u064E\u0670\u0637\u0650\u0628\u06E1\u0646\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u063A\u06E1\u0631\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0648\u064E\u064A\u064E\u0635\u06E1\u0646\u064E\u0639\u064F \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064E \u0648\u064E\u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627 \u0645\u064E\u0631\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0644\u064E\u0623\u065E \u0645\u0651\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0633\u064E\u062E\u0650\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u06DA \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646 \u062A\u064E\u0633\u06E1\u062E\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u0651\u064E\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u0633\u06E1\u062E\u064E\u0631\u064F \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627 \u062A\u064E\u0633\u06E1\u062E\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u064A\u064F\u062E\u06E1\u0632\u0650\u064A\u0647\u0650 \u0648\u064E\u064A\u064E\u062D\u0650\u0644\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0642\u0650\u064A\u0645\u064C" }, { id: 40, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0631\u064F\u0646\u064E\u0627 \u0648\u064E\u0641\u064E\u0627\u0631\u064E \u0671\u0644\u062A\u0651\u064E\u0646\u0651\u064F\u0648\u0631\u064F \u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0671\u062D\u06E1\u0645\u0650\u0644\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0656 \u0632\u064E\u0648\u06E1\u062C\u064E\u064A\u06E1\u0646\u0650 \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0633\u064E\u0628\u064E\u0642\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0648\u064E\u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u065E" }, { id: 41, text: "\u06DE\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0631\u06E1\u0643\u064E\u0628\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0628\u0650\u0633\u06E1\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u062C\u06E1\u0631\u065C\u0649\u0670\u0647\u064E\u0627 \u0648\u064E\u0645\u064F\u0631\u06E1\u0633\u064E\u0649\u0670\u0647\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 42, text: "\u0648\u064E\u0647\u0650\u064A\u064E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u0650\u064A \u0645\u064E\u0648\u06E1\u062C\u0656 \u0643\u064E\u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u0650 \u0648\u064E\u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0646\u064F\u0648\u062D\u064C \u0671\u0628\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A \u0645\u064E\u0639\u06E1\u0632\u0650\u0644\u0656 \u064A\u064E\u0670\u0628\u064F\u0646\u064E\u064A\u0651\u064E \u0671\u0631\u06E1\u0643\u064E\u0628 \u0645\u0651\u064E\u0639\u064E\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0646 \u0645\u0651\u064E\u0639\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 43, text: "\u0642\u064E\u0627\u0644\u064E \u0633\u064E\u0640\u0654\u064E\u0627\u0648\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u062C\u064E\u0628\u064E\u0644\u0656 \u064A\u064E\u0639\u06E1\u0635\u0650\u0645\u064F\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u0650\u06DA \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0627 \u0639\u064E\u0627\u0635\u0650\u0645\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0631\u0651\u064E\u062D\u0650\u0645\u064E\u06DA \u0648\u064E\u062D\u064E\u0627\u0644\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062C\u064F \u0641\u064E\u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u063A\u06E1\u0631\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 44, text: "\u0648\u064E\u0642\u0650\u064A\u0644\u064E \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0631\u06E1\u0636\u064F \u0671\u0628\u06E1\u0644\u064E\u0639\u0650\u064A \u0645\u064E\u0627\u0653\u0621\u064E\u0643\u0650 \u0648\u064E\u064A\u064E\u0670\u0633\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0623\u064E\u0642\u06E1\u0644\u0650\u0639\u0650\u064A \u0648\u064E\u063A\u0650\u064A\u0636\u064E \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u062C\u064F\u0648\u062F\u0650\u064A\u0651\u0650\u06D6 \u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0628\u064F\u0639\u06E1\u062F\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0646\u064F\u0648\u062D\u065E \u0631\u0651\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u064E \u0671\u0628\u06E1\u0646\u0650\u064A \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650\u064A \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E\u0643\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u0623\u064E\u062D\u06E1\u0643\u064E\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0670\u0643\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0646\u064F\u0648\u062D\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u064A\u06E1\u0633\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650\u0643\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0645\u064E\u0644\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0635\u064E\u0670\u0644\u0650\u062D\u0656\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u06E1\u0646\u0650 \u0645\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u064C\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u0650\u0638\u064F\u0643\u064E \u0623\u064E\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u064F\u0648\u0630\u064F \u0628\u0650\u0643\u064E \u0623\u064E\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064E\u0643\u064E \u0645\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u0650\u064A \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u065E\u06D6 \u0648\u064E\u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u0650\u064A \u0648\u064E\u062A\u064E\u0631\u06E1\u062D\u064E\u0645\u06E1\u0646\u0650\u064A\u0653 \u0623\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0642\u0650\u064A\u0644\u064E \u064A\u064E\u0670\u0646\u064F\u0648\u062D\u064F \u0671\u0647\u06E1\u0628\u0650\u0637\u06E1 \u0628\u0650\u0633\u064E\u0644\u064E\u0670\u0645\u0656 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u0628\u064E\u0631\u064E\u0643\u064E\u0670\u062A\u064D \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u064E\u0645\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0646 \u0645\u0651\u064E\u0639\u064E\u0643\u064E\u06DA \u0648\u064E\u0623\u064F\u0645\u064E\u0645\u065E \u0633\u064E\u0646\u064F\u0645\u064E\u062A\u0651\u0650\u0639\u064F\u0647\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0645\u064E\u0633\u0651\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 49, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0646\u064F\u0648\u062D\u0650\u064A\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0647\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0648\u064E\u0644\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u064F\u0643\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0647\u064E\u0670\u0630\u064E\u0627\u06D6 \u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064E \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0648\u064E\u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0627\u062F\u064D \u0623\u064E\u062E\u064E\u0627\u0647\u064F\u0645\u06E1 \u0647\u064F\u0648\u062F\u0657\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u063A\u064E\u064A\u06E1\u0631\u064F\u0647\u064F\u06E5\u0653\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064F\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u062C\u06E1\u0631\u064B\u0627\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u064E\u0637\u064E\u0631\u064E\u0646\u0650\u064A\u0653\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0648\u064E\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u062A\u064F\u0648\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u062F\u06E1\u0631\u064E\u0627\u0631\u0657\u0627 \u0648\u064E\u064A\u064E\u0632\u0650\u062F\u06E1\u0643\u064F\u0645\u06E1 \u0642\u064F\u0648\u0651\u064E\u0629\u064B \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064F\u0648\u0651\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 53, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0647\u064F\u0648\u062F\u064F \u0645\u064E\u0627 \u062C\u0650\u0626\u06E1\u062A\u064E\u0646\u064E\u0627 \u0628\u0650\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u062A\u064E\u0627\u0631\u0650\u0643\u0650\u064A\u0653 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u0650\u0646\u064E\u0627 \u0639\u064E\u0646 \u0642\u064E\u0648\u06E1\u0644\u0650\u0643\u064E \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0644\u064E\u0643\u064E \u0628\u0650\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u0625\u0650\u0646 \u0646\u0651\u064E\u0642\u064F\u0648\u0644\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0639\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u0628\u064E\u0639\u06E1\u0636\u064F \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u0650\u0646\u064E\u0627 \u0628\u0650\u0633\u064F\u0648\u0653\u0621\u0656\u06D7 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064F\u0634\u06E1\u0647\u0650\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u0650\u064A \u0628\u064E\u0631\u0650\u064A\u0653\u0621\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0643\u0650\u064A\u062F\u064F\u0648\u0646\u0650\u064A \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u062A\u064F\u0646\u0638\u0650\u0631\u064F\u0648\u0646\u0650" }, { id: 56, text: "\u0625\u0650\u0646\u0651\u0650\u064A \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u062A\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06DA \u0645\u0651\u064E\u0627 \u0645\u0650\u0646 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0621\u064E\u0627\u062E\u0650\u0630\u064F\u06E2 \u0628\u0650\u0646\u064E\u0627\u0635\u0650\u064A\u064E\u062A\u0650\u0647\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0639\u064E\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 57, text: "\u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0628\u06E1\u0644\u064E\u063A\u06E1\u062A\u064F\u0643\u064F\u0645 \u0645\u0651\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u06E1\u062A\u064F \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0644\u0650\u0641\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u0642\u064E\u0648\u06E1\u0645\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0636\u064F\u0631\u0651\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u062D\u064E\u0641\u0650\u064A\u0638\u065E" }, { id: 58, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0631\u064F\u0646\u064E\u0627 \u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0647\u064F\u0648\u062F\u0657\u0627 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064D \u063A\u064E\u0644\u0650\u064A\u0638\u0656" }, { id: 59, text: "\u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u0639\u064E\u0627\u062F\u065E\u06D6 \u062C\u064E\u062D\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0639\u064E\u0635\u064E\u0648\u06E1\u0627\u0652 \u0631\u064F\u0633\u064F\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0631\u064E \u0643\u064F\u0644\u0651\u0650 \u062C\u064E\u0628\u0651\u064E\u0627\u0631\u064D \u0639\u064E\u0646\u0650\u064A\u062F\u0656" }, { id: 60, text: "\u0648\u064E\u0623\u064F\u062A\u06E1\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0644\u064E\u0639\u06E1\u0646\u064E\u0629\u0657 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0627\u062F\u0657\u0627 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0623\u064E\u0644\u064E\u0627 \u0628\u064F\u0639\u06E1\u062F\u0657\u0627 \u0644\u0651\u0650\u0639\u064E\u0627\u062F\u0656 \u0642\u064E\u0648\u06E1\u0645\u0650 \u0647\u064F\u0648\u062F\u0656" }, { id: 61, text: "\u06DE\u0648\u064E\u0625\u0650\u0644\u064E\u0649\u0670 \u062B\u064E\u0645\u064F\u0648\u062F\u064E \u0623\u064E\u062E\u064E\u0627\u0647\u064F\u0645\u06E1 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u063A\u064E\u064A\u06E1\u0631\u064F\u0647\u064F\u06E5\u06D6 \u0647\u064F\u0648\u064E \u0623\u064E\u0646\u0634\u064E\u0623\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0639\u06E1\u0645\u064E\u0631\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0647\u064F \u062B\u064F\u0645\u0651\u064E \u062A\u064F\u0648\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0642\u064E\u0631\u0650\u064A\u0628\u065E \u0645\u0651\u064F\u062C\u0650\u064A\u0628\u065E" }, { id: 62, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0635\u064E\u0670\u0644\u0650\u062D\u064F \u0642\u064E\u062F\u06E1 \u0643\u064F\u0646\u062A\u064E \u0641\u0650\u064A\u0646\u064E\u0627 \u0645\u064E\u0631\u06E1\u062C\u064F\u0648\u0651\u0657\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627\u0653\u06D6 \u0623\u064E\u062A\u064E\u0646\u06E1\u0647\u064E\u0649\u0670\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064E\u0639\u06E1\u0628\u064F\u062F\u064E \u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0646\u064E\u0627 \u0644\u064E\u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064F\u0631\u0650\u064A\u0628\u0656" }, { id: 63, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0646\u0650\u064A \u0645\u0650\u0646\u06E1\u0647\u064F \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646\u06E1 \u0639\u064E\u0635\u064E\u064A\u06E1\u062A\u064F\u0647\u064F\u06E5\u06D6 \u0641\u064E\u0645\u064E\u0627 \u062A\u064E\u0632\u0650\u064A\u062F\u064F\u0648\u0646\u064E\u0646\u0650\u064A \u063A\u064E\u064A\u06E1\u0631\u064E \u062A\u064E\u062E\u06E1\u0633\u0650\u064A\u0631\u0656" }, { id: 64, text: "\u0648\u064E\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0646\u064E\u0627\u0642\u064E\u0629\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u0657\u06D6 \u0641\u064E\u0630\u064E\u0631\u064F\u0648\u0647\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u0636\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u064E\u0633\u0651\u064F\u0648\u0647\u064E\u0627 \u0628\u0650\u0633\u064F\u0648\u0653\u0621\u0656 \u0641\u064E\u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0642\u064E\u0631\u0650\u064A\u0628\u065E" }, { id: 65, text: "\u0641\u064E\u0639\u064E\u0642\u064E\u0631\u064F\u0648\u0647\u064E\u0627 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062F\u064E\u0627\u0631\u0650\u0643\u064F\u0645\u06E1 \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u064E \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656\u06D6 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0648\u064E\u0639\u06E1\u062F\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064E\u0643\u06E1\u0630\u064F\u0648\u0628\u0656" }, { id: 66, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0631\u064F\u0646\u064E\u0627 \u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u0645\u0650\u0646\u06E1 \u062E\u0650\u0632\u06E1\u064A\u0650 \u064A\u064E\u0648\u06E1\u0645\u0650\u0626\u0650\u0630\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F" }, { id: 67, text: "\u0648\u064E\u0623\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u062D\u064E\u0629\u064F \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0670\u062B\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 68, text: "\u0643\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u063A\u06E1\u0646\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627\u0653\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u062B\u064E\u0645\u064F\u0648\u062F\u064E\u0627\u0652 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0623\u064E\u0644\u064E\u0627 \u0628\u064F\u0639\u06E1\u062F\u0657\u0627 \u0644\u0651\u0650\u062B\u064E\u0645\u064F\u0648\u062F\u064E" }, { id: 69, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0646\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0628\u0650\u0671\u0644\u06E1\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0644\u064E\u0670\u0645\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0633\u064E\u0644\u064E\u0670\u0645\u065E\u06D6 \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0628\u0650\u062B\u064E \u0623\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0639\u0650\u062C\u06E1\u0644\u064D \u062D\u064E\u0646\u0650\u064A\u0630\u0656" }, { id: 70, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0621\u064E\u0627\u0653 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0635\u0650\u0644\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0646\u064E\u0643\u0650\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0648\u06E1\u062C\u064E\u0633\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062E\u0650\u064A\u0641\u064E\u0629\u0657\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0641\u06E1 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064F\u0648\u0637\u0656" }, { id: 71, text: "\u0648\u064E\u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064F\u0647\u064F\u06E5 \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u064E\u0629\u065E \u0641\u064E\u0636\u064E\u062D\u0650\u0643\u064E\u062A\u06E1 \u0641\u064E\u0628\u064E\u0634\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0628\u0650\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E" }, { id: 72, text: "\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u064A\u064E\u0670\u0648\u064E\u064A\u06E1\u0644\u064E\u062A\u064E\u0649\u0670\u0653 \u0621\u064E\u0623\u064E\u0644\u0650\u062F\u064F \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0639\u064E\u062C\u064F\u0648\u0632\u065E \u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u064E\u0639\u06E1\u0644\u0650\u064A \u0634\u064E\u064A\u06E1\u062E\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0634\u064E\u064A\u06E1\u0621\u064C \u0639\u064E\u062C\u0650\u064A\u0628\u065E" }, { id: 73, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062A\u064E\u0639\u06E1\u062C\u064E\u0628\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0628\u064E\u0631\u064E\u0643\u064E\u0670\u062A\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u062D\u064E\u0645\u0650\u064A\u062F\u065E \u0645\u0651\u064E\u062C\u0650\u064A\u062F\u065E" }, { id: 74, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0630\u064E\u0647\u064E\u0628\u064E \u0639\u064E\u0646\u06E1 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0671\u0644\u0631\u0651\u064E\u0648\u06E1\u0639\u064F \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F \u0671\u0644\u06E1\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0646\u064E\u0627 \u0641\u0650\u064A \u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064F\u0648\u0637\u064D" }, { id: 75, text: "\u0625\u0650\u0646\u0651\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0644\u064E\u062D\u064E\u0644\u0650\u064A\u0645\u064C \u0623\u064E\u0648\u0651\u064E\u0640\u0670\u0647\u065E \u0645\u0651\u064F\u0646\u0650\u064A\u0628\u065E" }, { id: 76, text: "\u064A\u064E\u0640\u0670\u0653\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064F \u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0631\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u062A\u0650\u064A\u0647\u0650\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064E\u0631\u06E1\u062F\u064F\u0648\u062F\u0656" }, { id: 77, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0646\u064E\u0627 \u0644\u064F\u0648\u0637\u0657\u0627 \u0633\u0650\u064A\u0653\u0621\u064E \u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0636\u064E\u0627\u0642\u064E \u0628\u0650\u0647\u0650\u0645\u06E1 \u0630\u064E\u0631\u06E1\u0639\u0657\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064C \u0639\u064E\u0635\u0650\u064A\u0628\u065E" }, { id: 78, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u06E5 \u0642\u064E\u0648\u06E1\u0645\u064F\u0647\u064F\u06E5 \u064A\u064F\u0647\u06E1\u0631\u064E\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u06DA \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0628\u064E\u0646\u064E\u0627\u062A\u0650\u064A \u0647\u064F\u0646\u0651\u064E \u0623\u064E\u0637\u06E1\u0647\u064E\u0631\u064F \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062E\u06E1\u0632\u064F\u0648\u0646\u0650 \u0641\u0650\u064A \u0636\u064E\u064A\u06E1\u0641\u0650\u064A\u0653\u06D6 \u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0631\u064E\u062C\u064F\u0644\u065E \u0631\u0651\u064E\u0634\u0650\u064A\u062F\u065E" }, { id: 79, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064E \u0645\u064E\u0627 \u0644\u064E\u0646\u064E\u0627 \u0641\u0650\u064A \u0628\u064E\u0646\u064E\u0627\u062A\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u062D\u064E\u0642\u0651\u0656 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0646\u064F\u0631\u0650\u064A\u062F\u064F" }, { id: 80, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0644\u0650\u064A \u0628\u0650\u0643\u064F\u0645\u06E1 \u0642\u064F\u0648\u0651\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u0621\u064E\u0627\u0648\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064F\u0643\u06E1\u0646\u0656 \u0634\u064E\u062F\u0650\u064A\u062F\u0656" }, { id: 81, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0644\u064F\u0648\u0637\u064F \u0625\u0650\u0646\u0651\u064E\u0627 \u0631\u064F\u0633\u064F\u0644\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0646 \u064A\u064E\u0635\u0650\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0641\u064E\u0623\u064E\u0633\u06E1\u0631\u0650 \u0628\u0650\u0623\u064E\u0647\u06E1\u0644\u0650\u0643\u064E \u0628\u0650\u0642\u0650\u0637\u06E1\u0639\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0644\u06E1\u062A\u064E\u0641\u0650\u062A\u06E1 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0623\u064E\u062D\u064E\u062F\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E\u0643\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u064F\u0635\u0650\u064A\u0628\u064F\u0647\u064E\u0627 \u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0645\u064E\u0648\u06E1\u0639\u0650\u062F\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064F\u0628\u06E1\u062D\u064F\u06DA \u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0671\u0644\u0635\u0651\u064F\u0628\u06E1\u062D\u064F \u0628\u0650\u0642\u064E\u0631\u0650\u064A\u0628\u0656" }, { id: 82, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0631\u064F\u0646\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0670\u0644\u0650\u064A\u064E\u0647\u064E\u0627 \u0633\u064E\u0627\u0641\u0650\u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0645\u06E1\u0637\u064E\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u062D\u0650\u062C\u064E\u0627\u0631\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0633\u0650\u062C\u0651\u0650\u064A\u0644\u0656 \u0645\u0651\u064E\u0646\u0636\u064F\u0648\u062F\u0656" }, { id: 83, text: "\u0645\u0651\u064F\u0633\u064E\u0648\u0651\u064E\u0645\u064E\u0629\u064B \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0647\u0650\u064A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0628\u0650\u0628\u064E\u0639\u0650\u064A\u062F\u0656" }, { id: 84, text: "\u06DE\u0648\u064E\u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u062F\u06E1\u064A\u064E\u0646\u064E \u0623\u064E\u062E\u064E\u0627\u0647\u064F\u0645\u06E1 \u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u0657\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u063A\u064E\u064A\u06E1\u0631\u064F\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u0642\u064F\u0635\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u0650\u0643\u06E1\u064A\u064E\u0627\u0644\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u0650\u064A\u0632\u064E\u0627\u0646\u064E\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0631\u064E\u0649\u0670\u0643\u064F\u0645 \u0628\u0650\u062E\u064E\u064A\u06E1\u0631\u0656 \u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u0656 \u0645\u0651\u064F\u062D\u0650\u064A\u0637\u0656" }, { id: 85, text: "\u0648\u064E\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0623\u064E\u0648\u06E1\u0641\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u0650\u0643\u06E1\u064A\u064E\u0627\u0644\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u0650\u064A\u0632\u064E\u0627\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u062E\u064E\u0633\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0623\u064E\u0634\u06E1\u064A\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062B\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 86, text: "\u0628\u064E\u0642\u0650\u064A\u0651\u064E\u062A\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0628\u0650\u062D\u064E\u0641\u0650\u064A\u0638\u0656" }, { id: 87, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u064F \u0623\u064E\u0635\u064E\u0644\u064E\u0648\u0670\u062A\u064F\u0643\u064E \u062A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0643\u064E \u0623\u064E\u0646 \u0646\u0651\u064E\u062A\u06E1\u0631\u064F\u0643\u064E \u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0639\u064E\u0644\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0646\u064E\u0627 \u0645\u064E\u0627 \u0646\u064E\u0634\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0623\u064E\u0646\u062A\u064E \u0671\u0644\u06E1\u062D\u064E\u0644\u0650\u064A\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0634\u0650\u064A\u062F\u064F" }, { id: 88, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0631\u064E\u0632\u064E\u0642\u064E\u0646\u0650\u064A \u0645\u0650\u0646\u06E1\u0647\u064F \u0631\u0650\u0632\u06E1\u0642\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646\u06E1 \u0623\u064F\u062E\u064E\u0627\u0644\u0650\u0641\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1\u0647\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u06DA \u0625\u0650\u0646\u06E1 \u0623\u064F\u0631\u0650\u064A\u062F\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0635\u06E1\u0644\u064E\u0670\u062D\u064E \u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0639\u06E1\u062A\u064F\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0648\u06E1\u0641\u0650\u064A\u0642\u0650\u064A\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u062A\u064F \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064F\u0646\u0650\u064A\u0628\u064F" }, { id: 89, text: "\u0648\u064E\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064E\u0627 \u064A\u064E\u062C\u06E1\u0631\u0650\u0645\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0634\u0650\u0642\u064E\u0627\u0642\u0650\u064A\u0653 \u0623\u064E\u0646 \u064A\u064F\u0635\u0650\u064A\u0628\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u062B\u06E1\u0644\u064F \u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E \u0642\u064E\u0648\u06E1\u0645\u064E \u0646\u064F\u0648\u062D\u064D \u0623\u064E\u0648\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064E \u0647\u064F\u0648\u062F\u064D \u0623\u064E\u0648\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0656\u06DA \u0648\u064E\u0645\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u064F \u0644\u064F\u0648\u0637\u0656 \u0645\u0651\u0650\u0646\u0643\u064F\u0645 \u0628\u0650\u0628\u064E\u0639\u0650\u064A\u062F\u0656" }, { id: 90, text: "\u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u062A\u064F\u0648\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0631\u064E\u062D\u0650\u064A\u0645\u065E \u0648\u064E\u062F\u064F\u0648\u062F\u065E" }, { id: 91, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u064F \u0645\u064E\u0627 \u0646\u064E\u0641\u06E1\u0642\u064E\u0647\u064F \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0642\u064F\u0648\u0644\u064F \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u0641\u0650\u064A\u0646\u064E\u0627 \u0636\u064E\u0639\u0650\u064A\u0641\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0631\u064E\u0647\u06E1\u0637\u064F\u0643\u064E \u0644\u064E\u0631\u064E\u062C\u064E\u0645\u06E1\u0646\u064E\u0670\u0643\u064E\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u0650\u0639\u064E\u0632\u0650\u064A\u0632\u0656" }, { id: 92, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0623\u064E\u0631\u064E\u0647\u06E1\u0637\u0650\u064A\u0653 \u0623\u064E\u0639\u064E\u0632\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0638\u0650\u0647\u06E1\u0631\u0650\u064A\u0651\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0645\u064F\u062D\u0650\u064A\u0637\u065E" }, { id: 93, text: "\u0648\u064E\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0639\u064E\u0670\u0645\u0650\u0644\u065E\u06D6 \u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u064A\u064F\u062E\u06E1\u0632\u0650\u064A\u0647\u0650 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0643\u064E\u0670\u0630\u0650\u0628\u065E\u06D6 \u0648\u064E\u0671\u0631\u06E1\u062A\u064E\u0642\u0650\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0642\u0650\u064A\u0628\u065E" }, { id: 94, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0631\u064F\u0646\u064E\u0627 \u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u0657\u0627 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u062D\u064E\u0629\u064F \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0670\u062B\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 95, text: "\u0643\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u063A\u06E1\u0646\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627\u0653\u06D7 \u0623\u064E\u0644\u064E\u0627 \u0628\u064F\u0639\u06E1\u062F\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u062F\u06E1\u064A\u064E\u0646\u064E \u0643\u064E\u0645\u064E\u0627 \u0628\u064E\u0639\u0650\u062F\u064E\u062A\u06E1 \u062B\u064E\u0645\u064F\u0648\u062F\u064F" }, { id: 96, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 97, text: "\u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0645\u064E\u0644\u064E\u0625\u0650\u064A\u0652\u0647\u0650\u06E6 \u0641\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0631\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0631\u064F \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0628\u0650\u0631\u064E\u0634\u0650\u064A\u062F\u0656" }, { id: 98, text: "\u064A\u064E\u0642\u06E1\u062F\u064F\u0645\u064F \u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u06E5 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0641\u064E\u0623\u064E\u0648\u06E1\u0631\u064E\u062F\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0648\u0650\u0631\u06E1\u062F\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u0631\u064F\u0648\u062F\u064F" }, { id: 99, text: "\u0648\u064E\u0623\u064F\u062A\u06E1\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0644\u064E\u0639\u06E1\u0646\u064E\u0629\u0657 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06DA \u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u0631\u0651\u0650\u0641\u06E1\u062F\u064F \u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u0641\u064F\u0648\u062F\u064F" }, { id: 100, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670 \u0646\u064E\u0642\u064F\u0635\u0651\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u065E \u0648\u064E\u062D\u064E\u0635\u0650\u064A\u062F\u065E" }, { id: 101, text: "\u0648\u064E\u0645\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0646\u064E\u062A\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0644\u0651\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0631\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0632\u064E\u0627\u062F\u064F\u0648\u0647\u064F\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064E \u062A\u064E\u062A\u06E1\u0628\u0650\u064A\u0628\u0656" }, { id: 102, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u062E\u06E1\u0630\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670 \u0648\u064E\u0647\u0650\u064A\u064E \u0638\u064E\u0670\u0644\u0650\u0645\u064E\u0629\u064C\u06DA \u0625\u0650\u0646\u0651\u064E \u0623\u064E\u062E\u06E1\u0630\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0644\u0650\u064A\u0645\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u064C" }, { id: 103, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0645\u064E\u0646\u06E1 \u062E\u064E\u0627\u0641\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0648\u06E1\u0645\u065E \u0645\u0651\u064E\u062C\u06E1\u0645\u064F\u0648\u0639\u065E \u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0648\u06E1\u0645\u065E \u0645\u0651\u064E\u0634\u06E1\u0647\u064F\u0648\u062F\u065E" }, { id: 104, text: "\u0648\u064E\u0645\u064E\u0627 \u0646\u064F\u0624\u064E\u062E\u0651\u0650\u0631\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064E\u0639\u06E1\u062F\u064F\u0648\u062F\u0656" }, { id: 105, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0623\u06E1\u062A\u0650 \u0644\u064E\u0627 \u062A\u064E\u0643\u064E\u0644\u0651\u064E\u0645\u064F \u0646\u064E\u0641\u06E1\u0633\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u0647\u0650\u06E6\u06DA \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0634\u064E\u0642\u0650\u064A\u0651\u065E \u0648\u064E\u0633\u064E\u0639\u0650\u064A\u062F\u065E" }, { id: 106, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0634\u064E\u0642\u064F\u0648\u0627\u0652 \u0641\u064E\u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0632\u064E\u0641\u0650\u064A\u0631\u065E \u0648\u064E\u0634\u064E\u0647\u0650\u064A\u0642\u064C" }, { id: 107, text: "\u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0627 \u062F\u064E\u0627\u0645\u064E\u062A\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0634\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0641\u064E\u0639\u0651\u064E\u0627\u0644\u065E \u0644\u0651\u0650\u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F" }, { id: 108, text: "\u06DE\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0633\u064F\u0639\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0627 \u062F\u064E\u0627\u0645\u064E\u062A\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0634\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E\u06D6 \u0639\u064E\u0637\u064E\u0627\u0653\u0621\u064B \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064E\u062C\u06E1\u0630\u064F\u0648\u0630\u0656" }, { id: 109, text: "\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F \u0641\u0650\u064A \u0645\u0650\u0631\u06E1\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650\u06DA \u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064F\u0648\u064E\u0641\u0651\u064F\u0648\u0647\u064F\u0645\u06E1 \u0646\u064E\u0635\u0650\u064A\u0628\u064E\u0647\u064F\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064E\u0646\u0642\u064F\u0648\u0635\u0656" }, { id: 110, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0641\u064E\u0671\u062E\u06E1\u062A\u064F\u0644\u0650\u0641\u064E \u0641\u0650\u064A\u0647\u0650\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u065E \u0633\u064E\u0628\u064E\u0642\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0645\u064F\u0631\u0650\u064A\u0628\u0656" }, { id: 111, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0643\u064F\u0644\u0651\u0657\u0627 \u0644\u0651\u064E\u0645\u0651\u064E\u0627 \u0644\u064E\u064A\u064F\u0648\u064E\u0641\u0651\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 112, text: "\u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0642\u0650\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064E \u0648\u064E\u0645\u064E\u0646 \u062A\u064E\u0627\u0628\u064E \u0645\u064E\u0639\u064E\u0643\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0637\u06E1\u063A\u064E\u0648\u06E1\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 113, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0631\u06E1\u0643\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0641\u064E\u062A\u064E\u0645\u064E\u0633\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u062A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 114, text: "\u0648\u064E\u0623\u064E\u0642\u0650\u0645\u0650 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0637\u064E\u0631\u064E\u0641\u064E\u064A\u0650 \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u0632\u064F\u0644\u064E\u0641\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0670\u062A\u0650 \u064A\u064F\u0630\u06E1\u0647\u0650\u0628\u06E1\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u0630\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 115, text: "\u0648\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u0636\u0650\u064A\u0639\u064F \u0623\u064E\u062C\u06E1\u0631\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 116, text: "\u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064F\u0648\u0646\u0650 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0642\u0650\u064A\u0651\u064E\u0629\u0656 \u064A\u064E\u0646\u06E1\u0647\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0641\u064E\u0633\u064E\u0627\u062F\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0646\u06E1 \u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064F\u062A\u06E1\u0631\u0650\u0641\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 117, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0644\u0650\u064A\u064F\u0647\u06E1\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670 \u0628\u0650\u0638\u064F\u0644\u06E1\u0645\u0656 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064F\u0647\u064E\u0627 \u0645\u064F\u0635\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 118, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0644\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0632\u064E\u0627\u0644\u064F\u0648\u0646\u064E \u0645\u064F\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 119, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0631\u0651\u064E\u062D\u0650\u0645\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E\u06DA \u0648\u064E\u0644\u0650\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u062A\u064E\u0645\u0651\u064E\u062A\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0623\u064E\u0645\u06E1\u0644\u064E\u0623\u064E\u0646\u0651\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 120, text: "\u0648\u064E\u0643\u064F\u0644\u0651\u0657\u0627 \u0646\u0651\u064E\u0642\u064F\u0635\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u0650 \u0645\u064E\u0627 \u0646\u064F\u062B\u064E\u0628\u0651\u0650\u062A\u064F \u0628\u0650\u0647\u0650\u06E6 \u0641\u064F\u0624\u064E\u0627\u062F\u064E\u0643\u064E\u06DA \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0645\u064E\u0648\u06E1\u0639\u0650\u0638\u064E\u0629\u065E \u0648\u064E\u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 121, text: "\u0648\u064E\u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0671\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0627 \u0639\u064E\u0670\u0645\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 122, text: "\u0648\u064E\u0671\u0646\u062A\u064E\u0638\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064F\u0646\u062A\u064E\u0638\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 123, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u063A\u064E\u064A\u06E1\u0628\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u0643\u064F\u0644\u0651\u064F\u0647\u064F\u06E5 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u06E1\u0647\u064F \u0648\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0628\u0650\u063A\u064E\u0670\u0641\u0650\u0644\u064D \u0639\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }] }, { id: 12, name: "\u064A\u0648\u0633\u0641", transliteration: "Yusuf", type: "meccan", total_verses: 111, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0631\u06DA \u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u0650" }, { id: 2, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0642\u064F\u0631\u06E1\u0621\u064E\u0670\u0646\u064B\u0627 \u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0646\u064E\u062D\u06E1\u0646\u064F \u0646\u064E\u0642\u064F\u0635\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0635\u064E\u0635\u0650 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0670\u0641\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 4, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u064A\u064F\u0648\u0633\u064F\u0641\u064F \u0644\u0650\u0623\u064E\u0628\u0650\u064A\u0647\u0650 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u062A\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064F \u0623\u064E\u062D\u064E\u062F\u064E \u0639\u064E\u0634\u064E\u0631\u064E \u0643\u064E\u0648\u06E1\u0643\u064E\u0628\u0657\u0627 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064F\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A \u0633\u064E\u0670\u062C\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 5, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0628\u064F\u0646\u064E\u064A\u0651\u064E \u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0635\u064F\u0635\u06E1 \u0631\u064F\u0621\u06E1\u064A\u064E\u0627\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u062E\u06E1\u0648\u064E\u062A\u0650\u0643\u064E \u0641\u064E\u064A\u064E\u0643\u0650\u064A\u062F\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064E \u0643\u064E\u064A\u06E1\u062F\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064E \u0644\u0650\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u0650 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 6, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u062C\u06E1\u062A\u064E\u0628\u0650\u064A\u0643\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0648\u064E\u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0643\u064E \u0645\u0650\u0646 \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u0650 \u0671\u0644\u06E1\u0623\u064E\u062D\u064E\u0627\u062F\u0650\u064A\u062B\u0650 \u0648\u064E\u064A\u064F\u062A\u0650\u0645\u0651\u064F \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u0644\u0650 \u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E \u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0645\u0651\u064E\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0628\u064E\u0648\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 7, text: "\u06DE\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0648\u064E\u0625\u0650\u062E\u06E1\u0648\u064E\u062A\u0650\u0647\u0650\u06E6\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u065E \u0644\u0651\u0650\u0644\u0633\u0651\u064E\u0627\u0653\u0626\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u064A\u064F\u0648\u0633\u064F\u0641\u064F \u0648\u064E\u0623\u064E\u062E\u064F\u0648\u0647\u064F \u0623\u064E\u062D\u064E\u0628\u0651\u064F \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0628\u0650\u064A\u0646\u064E\u0627 \u0645\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0639\u064F\u0635\u06E1\u0628\u064E\u0629\u064C \u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0628\u064E\u0627\u0646\u064E\u0627 \u0644\u064E\u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 9, text: "\u0671\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0627\u0652 \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0623\u064E\u0648\u0650 \u0671\u0637\u06E1\u0631\u064E\u062D\u064F\u0648\u0647\u064F \u0623\u064E\u0631\u06E1\u0636\u0657\u0627 \u064A\u064E\u062E\u06E1\u0644\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u062C\u06E1\u0647\u064F \u0623\u064E\u0628\u0650\u064A\u0643\u064F\u0645\u06E1 \u0648\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0635\u064E\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 10, text: "\u0642\u064E\u0627\u0644\u064E \u0642\u064E\u0627\u0653\u0626\u0650\u0644\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0627\u0652 \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064F\u0648\u0647\u064F \u0641\u0650\u064A \u063A\u064E\u064A\u064E\u0670\u0628\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u064F\u0628\u0651\u0650 \u064A\u064E\u0644\u06E1\u062A\u064E\u0642\u0650\u0637\u06E1\u0647\u064F \u0628\u064E\u0639\u06E1\u0636\u064F \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u064E\u0627\u0631\u064E\u0629\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u064E\u0670\u0639\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u0627\u0646\u064E\u0627 \u0645\u064E\u0627 \u0644\u064E\u0643\u064E \u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0645\u064E\u06EC\u0646\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0644\u064E\u0646\u064E\u0670\u0635\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0623\u064E\u0631\u06E1\u0633\u0650\u0644\u06E1\u0647\u064F \u0645\u064E\u0639\u064E\u0646\u064E\u0627 \u063A\u064E\u062F\u0657\u0627 \u064A\u064E\u0631\u06E1\u062A\u064E\u0639\u06E1 \u0648\u064E\u064A\u064E\u0644\u06E1\u0639\u064E\u0628\u06E1 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0644\u064E\u062D\u064E\u0670\u0641\u0650\u0638\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u064A\u064E\u062D\u06E1\u0632\u064F\u0646\u064F\u0646\u0650\u064A\u0653 \u0623\u064E\u0646 \u062A\u064E\u0630\u06E1\u0647\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064E\u0647\u064F \u0671\u0644\u0630\u0651\u0650\u0626\u06E1\u0628\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F \u063A\u064E\u0670\u0641\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0643\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u0630\u0651\u0650\u0626\u06E1\u0628\u064F \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0639\u064F\u0635\u06E1\u0628\u064E\u0629\u064C \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0630\u064E\u0647\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0647\u064F \u0641\u0650\u064A \u063A\u064E\u064A\u064E\u0670\u0628\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u064F\u0628\u0651\u0650\u06DA \u0648\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0644\u064E\u062A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0653 \u0623\u064E\u0628\u064E\u0627\u0647\u064F\u0645\u06E1 \u0639\u0650\u0634\u064E\u0627\u0653\u0621\u0657 \u064A\u064E\u0628\u06E1\u0643\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u0627\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0630\u064E\u0647\u064E\u0628\u06E1\u0646\u064E\u0627 \u0646\u064E\u0633\u06E1\u062A\u064E\u0628\u0650\u0642\u064F \u0648\u064E\u062A\u064E\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0639\u0650\u0646\u062F\u064E \u0645\u064E\u062A\u064E\u0670\u0639\u0650\u0646\u064E\u0627 \u0641\u064E\u0623\u064E\u0643\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u0630\u0651\u0650\u0626\u06E1\u0628\u064F\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0628\u0650\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0656 \u0644\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064F\u0646\u0651\u064E\u0627 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064F\u0648 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0645\u0650\u064A\u0635\u0650\u0647\u0650\u06E6 \u0628\u0650\u062F\u064E\u0645\u0656 \u0643\u064E\u0630\u0650\u0628\u0656\u06DA \u0642\u064E\u0627\u0644\u064E \u0628\u064E\u0644\u06E1 \u0633\u064E\u0648\u0651\u064E\u0644\u064E\u062A\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0657\u0627\u06D6 \u0641\u064E\u0635\u064E\u0628\u06E1\u0631\u065E \u062C\u064E\u0645\u0650\u064A\u0644\u065E\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0639\u064E\u0627\u0646\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u062A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0633\u064E\u064A\u0651\u064E\u0627\u0631\u064E\u0629\u065E \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0627\u0631\u0650\u062F\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u062F\u06E1\u0644\u064E\u0649\u0670 \u062F\u064E\u0644\u06E1\u0648\u064E\u0647\u064F\u06E5\u06D6 \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0647\u064E\u0670\u0630\u064E\u0627 \u063A\u064F\u0644\u064E\u0670\u0645\u065E\u06DA \u0648\u064E\u0623\u064E\u0633\u064E\u0631\u0651\u064F\u0648\u0647\u064F \u0628\u0650\u0636\u064E\u0670\u0639\u064E\u0629\u0657\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u0634\u064E\u0631\u064E\u0648\u06E1\u0647\u064F \u0628\u0650\u062B\u064E\u0645\u064E\u0646\u0650\u06ED \u0628\u064E\u062E\u06E1\u0633\u0656 \u062F\u064E\u0631\u064E\u0670\u0647\u0650\u0645\u064E \u0645\u064E\u0639\u06E1\u062F\u064F\u0648\u062F\u064E\u0629\u0656 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0632\u0651\u064E\u0640\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0671\u0634\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F \u0645\u0650\u0646 \u0645\u0651\u0650\u0635\u06E1\u0631\u064E \u0644\u0650\u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0643\u06E1\u0631\u0650\u0645\u0650\u064A \u0645\u064E\u062B\u06E1\u0648\u064E\u0649\u0670\u0647\u064F \u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0646\u0641\u064E\u0639\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0646\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u062F\u0657\u0627\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u0643\u0651\u064E\u0646\u0651\u064E\u0627 \u0644\u0650\u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u0650\u0646\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u0650 \u0671\u0644\u06E1\u0623\u064E\u062D\u064E\u0627\u062F\u0650\u064A\u062B\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0627\u0644\u0650\u0628\u064C \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E \u0623\u064E\u0634\u064F\u062F\u0651\u064E\u0647\u064F\u06E5\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u062D\u064F\u0643\u06E1\u0645\u0657\u0627 \u0648\u064E\u0639\u0650\u0644\u06E1\u0645\u0657\u0627\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 23, text: "\u0648\u064E\u0631\u064E\u0670\u0648\u064E\u062F\u064E\u062A\u06E1\u0647\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0628\u064E\u064A\u06E1\u062A\u0650\u0647\u064E\u0627 \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0648\u064E\u063A\u064E\u0644\u0651\u064E\u0642\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u064E \u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0647\u064E\u064A\u06E1\u062A\u064E \u0644\u064E\u0643\u064E\u06DA \u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0639\u064E\u0627\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0645\u064E\u062B\u06E1\u0648\u064E\u0627\u064A\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0647\u064E\u0645\u0651\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0647\u064E\u0645\u0651\u064E \u0628\u0650\u0647\u064E\u0627 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u0631\u0651\u064E\u0621\u064E\u0627 \u0628\u064F\u0631\u06E1\u0647\u064E\u0670\u0646\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u0646\u064E\u0635\u06E1\u0631\u0650\u0641\u064E \u0639\u064E\u0646\u06E1\u0647\u064F \u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u064E \u0648\u064E\u0671\u0644\u06E1\u0641\u064E\u062D\u06E1\u0634\u064E\u0627\u0653\u0621\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0644\u064E\u0635\u0650\u064A\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0628\u064E\u0642\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0627\u0628\u064E \u0648\u064E\u0642\u064E\u062F\u0651\u064E\u062A\u06E1 \u0642\u064E\u0645\u0650\u064A\u0635\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u062F\u064F\u0628\u064F\u0631\u0656 \u0648\u064E\u0623\u064E\u0644\u06E1\u0641\u064E\u064A\u064E\u0627 \u0633\u064E\u064A\u0651\u0650\u062F\u064E\u0647\u064E\u0627 \u0644\u064E\u062F\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0627\u0628\u0650\u06DA \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0645\u064E\u0627 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0645\u064E\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0628\u0650\u0623\u064E\u0647\u06E1\u0644\u0650\u0643\u064E \u0633\u064F\u0648\u0653\u0621\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u0633\u06E1\u062C\u064E\u0646\u064E \u0623\u064E\u0648\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 26, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u0650\u064A\u064E \u0631\u064E\u0670\u0648\u064E\u062F\u064E\u062A\u06E1\u0646\u0650\u064A \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0650\u064A\u06DA \u0648\u064E\u0634\u064E\u0647\u0650\u062F\u064E \u0634\u064E\u0627\u0647\u0650\u062F\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0642\u064E\u0645\u0650\u064A\u0635\u064F\u0647\u064F\u06E5 \u0642\u064F\u062F\u0651\u064E \u0645\u0650\u0646 \u0642\u064F\u0628\u064F\u0644\u0656 \u0641\u064E\u0635\u064E\u062F\u064E\u0642\u064E\u062A\u06E1 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 27, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0642\u064E\u0645\u0650\u064A\u0635\u064F\u0647\u064F\u06E5 \u0642\u064F\u062F\u0651\u064E \u0645\u0650\u0646 \u062F\u064F\u0628\u064F\u0631\u0656 \u0641\u064E\u0643\u064E\u0630\u064E\u0628\u064E\u062A\u06E1 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0621\u064E\u0627 \u0642\u064E\u0645\u0650\u064A\u0635\u064E\u0647\u064F\u06E5 \u0642\u064F\u062F\u0651\u064E \u0645\u0650\u0646 \u062F\u064F\u0628\u064F\u0631\u0656 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0643\u064E\u064A\u06E1\u062F\u0650\u0643\u064F\u0646\u0651\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E \u0643\u064E\u064A\u06E1\u062F\u064E\u0643\u064F\u0646\u0651\u064E \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 29, text: "\u064A\u064F\u0648\u0633\u064F\u0641\u064F \u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u06DA \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u0650\u064A \u0644\u0650\u0630\u064E\u0646\u06E2\u0628\u0650\u0643\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u0650 \u0643\u064F\u0646\u062A\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0627\u0637\u0650\u0640\u0654\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u06DE\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0646\u0650\u0633\u06E1\u0648\u064E\u0629\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u062A\u064F\u0631\u064E\u0670\u0648\u0650\u062F\u064F \u0641\u064E\u062A\u064E\u0649\u0670\u0647\u064E\u0627 \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0642\u064E\u062F\u06E1 \u0634\u064E\u063A\u064E\u0641\u064E\u0647\u064E\u0627 \u062D\u064F\u0628\u0651\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u0631\u064E\u0649\u0670\u0647\u064E\u0627 \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 31, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u064E\u062A\u06E1 \u0628\u0650\u0645\u064E\u0643\u06E1\u0631\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u064E\u062A\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0645\u064F\u062A\u0651\u064E\u0643\u064E\u0640\u0654\u0657\u0627 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u062A\u06E1 \u0643\u064F\u0644\u0651\u064E \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0646\u0651\u064E \u0633\u0650\u0643\u0651\u0650\u064A\u0646\u0657\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u062E\u06E1\u0631\u064F\u062C\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0623\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u0642\u064E\u0637\u0651\u064E\u0639\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0642\u064F\u0644\u06E1\u0646\u064E \u062D\u064E\u0670\u0634\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u064B\u0627 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u065E" }, { id: 32, text: "\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0641\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064F\u0645\u06E1\u062A\u064F\u0646\u0651\u064E\u0646\u0650\u064A \u0641\u0650\u064A\u0647\u0650\u06D6 \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0631\u064E\u0670\u0648\u064E\u062F\u062A\u0651\u064F\u0647\u064F\u06E5 \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0639\u06E1\u0635\u064E\u0645\u064E\u06D6 \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u06E1 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064F\u0631\u064F\u0647\u064F\u06E5 \u0644\u064E\u064A\u064F\u0633\u06E1\u062C\u064E\u0646\u064E\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u063A\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u0633\u0651\u0650\u062C\u06E1\u0646\u064F \u0623\u064E\u062D\u064E\u0628\u0651\u064F \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u06D6 \u0648\u064E\u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u0635\u06E1\u0631\u0650\u0641\u06E1 \u0639\u064E\u0646\u0651\u0650\u064A \u0643\u064E\u064A\u06E1\u062F\u064E\u0647\u064F\u0646\u0651\u064E \u0623\u064E\u0635\u06E1\u0628\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0623\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 34, text: "\u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0627\u0628\u064E \u0644\u064E\u0647\u064F\u06E5 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u06E5 \u0641\u064E\u0635\u064E\u0631\u064E\u0641\u064E \u0639\u064E\u0646\u06E1\u0647\u064F \u0643\u064E\u064A\u06E1\u062F\u064E\u0647\u064F\u0646\u0651\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 35, text: "\u062B\u064F\u0645\u0651\u064E \u0628\u064E\u062F\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u064E\u064A\u064E\u0633\u06E1\u062C\u064F\u0646\u064F\u0646\u0651\u064E\u0647\u064F\u06E5 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 36, text: "\u0648\u064E\u062F\u064E\u062E\u064E\u0644\u064E \u0645\u064E\u0639\u064E\u0647\u064F \u0671\u0644\u0633\u0651\u0650\u062C\u06E1\u0646\u064E \u0641\u064E\u062A\u064E\u064A\u064E\u0627\u0646\u0650\u06D6 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u062D\u064E\u062F\u064F\u0647\u064F\u0645\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0631\u064E\u0649\u0670\u0646\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0635\u0650\u0631\u064F \u062E\u064E\u0645\u06E1\u0631\u0657\u0627\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u064E\u0631\u064F \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0631\u064E\u0649\u0670\u0646\u0650\u064A\u0653 \u0623\u064E\u062D\u06E1\u0645\u0650\u0644\u064F \u0641\u064E\u0648\u06E1\u0642\u064E \u0631\u064E\u0623\u06E1\u0633\u0650\u064A \u062E\u064F\u0628\u06E1\u0632\u0657\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F \u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u06D6 \u0646\u064E\u0628\u0651\u0650\u0626\u06E1\u0646\u064E\u0627 \u0628\u0650\u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u0650\u0647\u0650\u06E6\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 37, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0643\u064F\u0645\u064E\u0627 \u0637\u064E\u0639\u064E\u0627\u0645\u065E \u062A\u064F\u0631\u06E1\u0632\u064E\u0642\u064E\u0627\u0646\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u0628\u0651\u064E\u0623\u06E1\u062A\u064F\u0643\u064F\u0645\u064E\u0627 \u0628\u0650\u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u0650\u0647\u0650\u06E6 \u0642\u064E\u0628\u06E1\u0644\u064E \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0643\u064F\u0645\u064E\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064E\u0627 \u0645\u0650\u0645\u0651\u064E\u0627 \u0639\u064E\u0644\u0651\u064E\u0645\u064E\u0646\u0650\u064A \u0631\u064E\u0628\u0651\u0650\u064A\u0653\u06DA \u0625\u0650\u0646\u0651\u0650\u064A \u062A\u064E\u0631\u064E\u0643\u06E1\u062A\u064F \u0645\u0650\u0644\u0651\u064E\u0629\u064E \u0642\u064E\u0648\u06E1\u0645\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0647\u064F\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u06E1\u062A\u064F \u0645\u0650\u0644\u0651\u064E\u0629\u064E \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u0650\u064A\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E\u06DA \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064F\u0634\u06E1\u0631\u0650\u0643\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u064A\u064E\u0670\u0635\u064E\u0670\u062D\u0650\u0628\u064E\u064A\u0650 \u0671\u0644\u0633\u0651\u0650\u062C\u06E1\u0646\u0650 \u0621\u064E\u0623\u064E\u0631\u06E1\u0628\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u062A\u064E\u0641\u064E\u0631\u0651\u0650\u0642\u064F\u0648\u0646\u064E \u062E\u064E\u064A\u06E1\u0631\u064C \u0623\u064E\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0648\u064E\u0670\u062D\u0650\u062F\u064F \u0671\u0644\u06E1\u0642\u064E\u0647\u0651\u064E\u0627\u0631\u064F" }, { id: 40, text: "\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0621\u0657 \u0633\u064E\u0645\u0651\u064E\u064A\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645 \u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u064E\u0627 \u0645\u0650\u0646 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u064D\u06DA \u0625\u0650\u0646\u0650 \u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0645\u064E\u0631\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u064A\u0651\u064E\u0627\u0647\u064F\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064F \u0671\u0644\u06E1\u0642\u064E\u064A\u0651\u0650\u0645\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 41, text: "\u064A\u064E\u0670\u0635\u064E\u0670\u062D\u0650\u0628\u064E\u064A\u0650 \u0671\u0644\u0633\u0651\u0650\u062C\u06E1\u0646\u0650 \u0623\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062D\u064E\u062F\u064F\u0643\u064F\u0645\u064E\u0627 \u0641\u064E\u064A\u064E\u0633\u06E1\u0642\u0650\u064A \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u062E\u064E\u0645\u06E1\u0631\u0657\u0627\u06D6 \u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u062E\u064E\u0631\u064F \u0641\u064E\u064A\u064F\u0635\u06E1\u0644\u064E\u0628\u064F \u0641\u064E\u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F \u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0623\u06E1\u0633\u0650\u0647\u0650\u06E6\u06DA \u0642\u064F\u0636\u0650\u064A\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u0650\u064A\u0647\u0650 \u062A\u064E\u0633\u06E1\u062A\u064E\u0641\u06E1\u062A\u0650\u064A\u064E\u0627\u0646\u0650" }, { id: 42, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A \u0638\u064E\u0646\u0651\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0646\u064E\u0627\u062C\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0671\u0630\u06E1\u0643\u064F\u0631\u06E1\u0646\u0650\u064A \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u0623\u064E\u0646\u0633\u064E\u0649\u0670\u0647\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0630\u0650\u0643\u06E1\u0631\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0641\u064E\u0644\u064E\u0628\u0650\u062B\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u0650\u062C\u06E1\u0646\u0650 \u0628\u0650\u0636\u06E1\u0639\u064E \u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u0650\u0643\u064F \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0631\u064E\u0649\u0670 \u0633\u064E\u0628\u06E1\u0639\u064E \u0628\u064E\u0642\u064E\u0631\u064E\u0670\u062A\u0656 \u0633\u0650\u0645\u064E\u0627\u0646\u0656 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0647\u064F\u0646\u0651\u064E \u0633\u064E\u0628\u06E1\u0639\u064C \u0639\u0650\u062C\u064E\u0627\u0641\u065E \u0648\u064E\u0633\u064E\u0628\u06E1\u0639\u064E \u0633\u064F\u0646\u06E2\u0628\u064F\u0644\u064E\u0670\u062A\u064D \u062E\u064F\u0636\u06E1\u0631\u0656 \u0648\u064E\u0623\u064F\u062E\u064E\u0631\u064E \u064A\u064E\u0627\u0628\u0650\u0633\u064E\u0670\u062A\u0656\u06D6 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0623\u064E\u0641\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0641\u0650\u064A \u0631\u064F\u0621\u06E1\u064A\u064E\u0670\u064A\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0644\u0650\u0644\u0631\u0651\u064F\u0621\u06E1\u064A\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0636\u06E1\u063A\u064E\u0670\u062B\u064F \u0623\u064E\u062D\u06E1\u0644\u064E\u0670\u0645\u0656\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u0650 \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0644\u064E\u0670\u0645\u0650 \u0628\u0650\u0639\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0646\u064E\u062C\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u0671\u062F\u0651\u064E\u0643\u064E\u0631\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0623\u064F\u0645\u0651\u064E\u0629\u064D \u0623\u064E\u0646\u064E\u0627\u06E0 \u0623\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u0650\u0644\u064F\u0648\u0646\u0650" }, { id: 46, text: "\u064A\u064F\u0648\u0633\u064F\u0641\u064F \u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0635\u0651\u0650\u062F\u0651\u0650\u064A\u0642\u064F \u0623\u064E\u0641\u06E1\u062A\u0650\u0646\u064E\u0627 \u0641\u0650\u064A \u0633\u064E\u0628\u06E1\u0639\u0650 \u0628\u064E\u0642\u064E\u0631\u064E\u0670\u062A\u0656 \u0633\u0650\u0645\u064E\u0627\u0646\u0656 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0647\u064F\u0646\u0651\u064E \u0633\u064E\u0628\u06E1\u0639\u064C \u0639\u0650\u062C\u064E\u0627\u0641\u065E \u0648\u064E\u0633\u064E\u0628\u06E1\u0639\u0650 \u0633\u064F\u0646\u06E2\u0628\u064F\u0644\u064E\u0670\u062A\u064D \u062E\u064F\u0636\u06E1\u0631\u0656 \u0648\u064E\u0623\u064F\u062E\u064E\u0631\u064E \u064A\u064E\u0627\u0628\u0650\u0633\u064E\u0670\u062A\u0656 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u062C\u0650\u0639\u064F \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0642\u064E\u0627\u0644\u064E \u062A\u064E\u0632\u06E1\u0631\u064E\u0639\u064F\u0648\u0646\u064E \u0633\u064E\u0628\u06E1\u0639\u064E \u0633\u0650\u0646\u0650\u064A\u0646\u064E \u062F\u064E\u0623\u064E\u0628\u0657\u0627 \u0641\u064E\u0645\u064E\u0627 \u062D\u064E\u0635\u064E\u062F\u062A\u0651\u064F\u0645\u06E1 \u0641\u064E\u0630\u064E\u0631\u064F\u0648\u0647\u064F \u0641\u0650\u064A \u0633\u064F\u0646\u06E2\u0628\u064F\u0644\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0623\u06E1\u062A\u0650\u064A \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0633\u064E\u0628\u06E1\u0639\u065E \u0634\u0650\u062F\u064E\u0627\u062F\u065E \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u06E1\u0646\u064E \u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064F\u062D\u06E1\u0635\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0623\u06E1\u062A\u0650\u064A \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0627\u0645\u065E \u0641\u0650\u064A\u0647\u0650 \u064A\u064F\u063A\u064E\u0627\u062B\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0648\u064E\u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u0639\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u0650\u0643\u064F \u0671\u0626\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0642\u064E\u0627\u0644\u064E \u0671\u0631\u06E1\u062C\u0650\u0639\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u06E1\u0647\u064F \u0645\u064E\u0627 \u0628\u064E\u0627\u0644\u064F \u0671\u0644\u0646\u0651\u0650\u0633\u06E1\u0648\u064E\u0629\u0650 \u0671\u0644\u0651\u064E\u0640\u0670\u062A\u0650\u064A \u0642\u064E\u0637\u0651\u064E\u0639\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0646\u0651\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0628\u0650\u0643\u064E\u064A\u06E1\u062F\u0650\u0647\u0650\u0646\u0651\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 51, text: "\u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0627 \u062E\u064E\u0637\u06E1\u0628\u064F\u0643\u064F\u0646\u0651\u064E \u0625\u0650\u0630\u06E1 \u0631\u064E\u0670\u0648\u064E\u062F\u062A\u0651\u064F\u0646\u0651\u064E \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06DA \u0642\u064F\u0644\u06E1\u0646\u064E \u062D\u064E\u0670\u0634\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0639\u064E\u0644\u0650\u0645\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646 \u0633\u064F\u0648\u0653\u0621\u0656\u06DA \u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u0640\u0654\u064E\u0670\u0646\u064E \u062D\u064E\u0635\u06E1\u062D\u064E\u0635\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0623\u064E\u0646\u064E\u0627\u06E0 \u0631\u064E\u0670\u0648\u064E\u062F\u062A\u0651\u064F\u0647\u064F\u06E5 \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 52, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0623\u064E\u0646\u0651\u0650\u064A \u0644\u064E\u0645\u06E1 \u0623\u064E\u062E\u064F\u0646\u06E1\u0647\u064F \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0643\u064E\u064A\u06E1\u062F\u064E \u0671\u0644\u06E1\u062E\u064E\u0627\u0653\u0626\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 53, text: "\u06DE\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0628\u064E\u0631\u0651\u0650\u0626\u064F \u0646\u064E\u0641\u06E1\u0633\u0650\u064A\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0646\u0651\u064E\u0641\u06E1\u0633\u064E \u0644\u064E\u0623\u064E\u0645\u0651\u064E\u0627\u0631\u064E\u0629\u064F\u06E2 \u0628\u0650\u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0631\u064E\u062D\u0650\u0645\u064E \u0631\u064E\u0628\u0651\u0650\u064A\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 54, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u0650\u0643\u064F \u0671\u0626\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0644\u0650\u0635\u06E1\u0647\u064F \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u064A\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0644\u0651\u064E\u0645\u064E\u0647\u064F\u06E5 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064E\u0643\u0650\u064A\u0646\u064C \u0623\u064E\u0645\u0650\u064A\u0646\u065E" }, { id: 55, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u0650\u064A \u0639\u064E\u0644\u064E\u0649\u0670 \u062E\u064E\u0632\u064E\u0627\u0653\u0626\u0650\u0646\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A \u062D\u064E\u0641\u0650\u064A\u0638\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 56, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u0643\u0651\u064E\u0646\u0651\u064E\u0627 \u0644\u0650\u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u064A\u064E\u062A\u064E\u0628\u064E\u0648\u0651\u064E\u0623\u064F \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062D\u064E\u064A\u06E1\u062B\u064F \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0646\u064F\u0635\u0650\u064A\u0628\u064F \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0646\u064E\u0627 \u0645\u064E\u0646 \u0646\u0651\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0648\u064E\u0644\u064E\u0627 \u0646\u064F\u0636\u0650\u064A\u0639\u064F \u0623\u064E\u062C\u06E1\u0631\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 57, text: "\u0648\u064E\u0644\u064E\u0623\u064E\u062C\u06E1\u0631\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u062E\u06E1\u0648\u064E\u0629\u064F \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0641\u064E\u062F\u064E\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u064E\u0639\u064E\u0631\u064E\u0641\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0646\u0643\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0647\u0651\u064E\u0632\u064E\u0647\u064F\u0645 \u0628\u0650\u062C\u064E\u0647\u064E\u0627\u0632\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0644\u064E \u0671\u0626\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0628\u0650\u0623\u064E\u062E\u0656 \u0644\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0628\u0650\u064A\u0643\u064F\u0645\u06E1\u06DA \u0623\u064E\u0644\u064E\u0627 \u062A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E \u0623\u064E\u0646\u0651\u0650\u064A\u0653 \u0623\u064F\u0648\u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u0632\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 60, text: "\u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u0644\u064E\u0627 \u0643\u064E\u064A\u06E1\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u0650\u064A \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0646\u0650" }, { id: 61, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0646\u064F\u0631\u064E\u0670\u0648\u0650\u062F\u064F \u0639\u064E\u0646\u06E1\u0647\u064F \u0623\u064E\u0628\u064E\u0627\u0647\u064F \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0641\u064E\u0670\u0639\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0641\u0650\u062A\u06E1\u064A\u064E\u0670\u0646\u0650\u0647\u0650 \u0671\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0628\u0650\u0636\u064E\u0670\u0639\u064E\u062A\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0631\u0650\u062D\u064E\u0627\u0644\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E\u0647\u064E\u0627\u0653 \u0625\u0650\u0630\u064E\u0627 \u0671\u0646\u0642\u064E\u0644\u064E\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u062C\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0628\u0650\u064A\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u0627\u0646\u064E\u0627 \u0645\u064F\u0646\u0650\u0639\u064E \u0645\u0650\u0646\u0651\u064E\u0627 \u0671\u0644\u06E1\u0643\u064E\u064A\u06E1\u0644\u064F \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u0650\u0644\u06E1 \u0645\u064E\u0639\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u062E\u064E\u0627\u0646\u064E\u0627 \u0646\u064E\u0643\u06E1\u062A\u064E\u0644\u06E1 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0644\u064E\u062D\u064E\u0670\u0641\u0650\u0638\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0644\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u0650\u0646\u062A\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0641\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u064A\u06E1\u0631\u064C \u062D\u064E\u0670\u0641\u0650\u0638\u0657\u0627\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0631\u06E1\u062D\u064E\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u062D\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 65, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0641\u064E\u062A\u064E\u062D\u064F\u0648\u0627\u0652 \u0645\u064E\u062A\u064E\u0670\u0639\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u062C\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0636\u064E\u0670\u0639\u064E\u062A\u064E\u0647\u064F\u0645\u06E1 \u0631\u064F\u062F\u0651\u064E\u062A\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u0627\u0646\u064E\u0627 \u0645\u064E\u0627 \u0646\u064E\u0628\u06E1\u063A\u0650\u064A\u06D6 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0628\u0650\u0636\u064E\u0670\u0639\u064E\u062A\u064F\u0646\u064E\u0627 \u0631\u064F\u062F\u0651\u064E\u062A\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u06D6 \u0648\u064E\u0646\u064E\u0645\u0650\u064A\u0631\u064F \u0623\u064E\u0647\u06E1\u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u0646\u064E\u062D\u06E1\u0641\u064E\u0638\u064F \u0623\u064E\u062E\u064E\u0627\u0646\u064E\u0627 \u0648\u064E\u0646\u064E\u0632\u06E1\u062F\u064E\u0627\u062F\u064F \u0643\u064E\u064A\u06E1\u0644\u064E \u0628\u064E\u0639\u0650\u064A\u0631\u0656\u06D6 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0643\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0633\u0650\u064A\u0631\u065E" }, { id: 66, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0646\u06E1 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u0650 \u0645\u064E\u0648\u06E1\u062B\u0650\u0642\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0646\u0651\u064E\u0646\u0650\u064A \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u062D\u064E\u0627\u0637\u064E \u0628\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0648\u06E1\u0647\u064F \u0645\u064E\u0648\u06E1\u062B\u0650\u0642\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0646\u064E\u0642\u064F\u0648\u0644\u064F \u0648\u064E\u0643\u0650\u064A\u0644\u065E" }, { id: 67, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0651\u064E \u0644\u064E\u0627 \u062A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0627\u0628\u0656 \u0648\u064E\u0670\u062D\u0650\u062F\u0656 \u0648\u064E\u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u0656 \u0645\u0651\u064F\u062A\u064E\u0641\u064E\u0631\u0651\u0650\u0642\u064E\u0629\u0656\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u063A\u06E1\u0646\u0650\u064A \u0639\u064E\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D\u06D6 \u0625\u0650\u0646\u0650 \u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06D6 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u062A\u064F\u06D6 \u0648\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0648\u064E\u0643\u0651\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062F\u064E\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0623\u064E\u0645\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0628\u064F\u0648\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u064A\u064F\u063A\u06E1\u0646\u0650\u064A \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u062D\u064E\u0627\u062C\u064E\u0629\u0657 \u0641\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u0650 \u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E \u0642\u064E\u0636\u064E\u0649\u0670\u0647\u064E\u0627\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0630\u064F\u0648 \u0639\u0650\u0644\u06E1\u0645\u0656 \u0644\u0651\u0650\u0645\u064E\u0627 \u0639\u064E\u0644\u0651\u064E\u0645\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062F\u064E\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0621\u064E\u0627\u0648\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u062E\u064E\u0627\u0647\u064F\u06D6 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0623\u064E\u062E\u064F\u0648\u0643\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u062A\u064E\u0626\u0650\u0633\u06E1 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0647\u0651\u064E\u0632\u064E\u0647\u064F\u0645 \u0628\u0650\u062C\u064E\u0647\u064E\u0627\u0632\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0633\u0651\u0650\u0642\u064E\u0627\u064A\u064E\u0629\u064E \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0644\u0650 \u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0630\u0651\u064E\u0646\u064E \u0645\u064F\u0624\u064E\u0630\u0651\u0650\u0646\u064C \u0623\u064E\u064A\u0651\u064E\u062A\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0639\u0650\u064A\u0631\u064F \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0633\u064E\u0670\u0631\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0642\u06E1\u0628\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064E\u0627\u0630\u064E\u0627 \u062A\u064E\u0641\u06E1\u0642\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0646\u064E\u0641\u06E1\u0642\u0650\u062F\u064F \u0635\u064F\u0648\u064E\u0627\u0639\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u0650\u0643\u0650 \u0648\u064E\u0644\u0650\u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0647\u0650\u06E6 \u062D\u0650\u0645\u06E1\u0644\u064F \u0628\u064E\u0639\u0650\u064A\u0631\u0656 \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0628\u0650\u0647\u0650\u06E6 \u0632\u064E\u0639\u0650\u064A\u0645\u065E" }, { id: 73, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062A\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u062C\u0650\u0626\u06E1\u0646\u064E\u0627 \u0644\u0650\u0646\u064F\u0641\u06E1\u0633\u0650\u062F\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0633\u064E\u0670\u0631\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 74, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0645\u064E\u0627 \u062C\u064E\u0632\u064E\u0640\u0670\u0653\u0624\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 75, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062C\u064E\u0632\u064E\u0640\u0670\u0653\u0624\u064F\u0647\u064F\u06E5 \u0645\u064E\u0646 \u0648\u064F\u062C\u0650\u062F\u064E \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u0647\u064F\u0648\u064E \u062C\u064E\u0632\u064E\u0640\u0670\u0653\u0624\u064F\u0647\u064F\u06E5\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 76, text: "\u0641\u064E\u0628\u064E\u062F\u064E\u0623\u064E \u0628\u0650\u0623\u064E\u0648\u06E1\u0639\u0650\u064A\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0628\u06E1\u0644\u064E \u0648\u0650\u0639\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u062E\u06E1\u0631\u064E\u062C\u064E\u0647\u064E\u0627 \u0645\u0650\u0646 \u0648\u0650\u0639\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u062E\u0650\u064A\u0647\u0650\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0643\u0650\u062F\u06E1\u0646\u064E\u0627 \u0644\u0650\u064A\u064F\u0648\u0633\u064F\u0641\u064E\u06D6 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064E \u0623\u064E\u062E\u064E\u0627\u0647\u064F \u0641\u0650\u064A \u062F\u0650\u064A\u0646\u0650 \u0671\u0644\u06E1\u0645\u064E\u0644\u0650\u0643\u0650 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0646\u064E\u0631\u06E1\u0641\u064E\u0639\u064F \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u0656 \u0645\u0651\u064E\u0646 \u0646\u0651\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0641\u064E\u0648\u06E1\u0642\u064E \u0643\u064F\u0644\u0651\u0650 \u0630\u0650\u064A \u0639\u0650\u0644\u06E1\u0645\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 77, text: "\u06DE\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u064A\u064E\u0633\u06E1\u0631\u0650\u0642\u06E1 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0633\u064E\u0631\u064E\u0642\u064E \u0623\u064E\u062E\u065E \u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06DA \u0641\u064E\u0623\u064E\u0633\u064E\u0631\u0651\u064E\u0647\u064E\u0627 \u064A\u064F\u0648\u0633\u064F\u0641\u064F \u0641\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0628\u06E1\u062F\u0650\u0647\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0634\u064E\u0631\u0651\u065E \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u0657\u0627\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 78, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0628\u0657\u0627 \u0634\u064E\u064A\u06E1\u062E\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627 \u0641\u064E\u062E\u064F\u0630\u06E1 \u0623\u064E\u062D\u064E\u062F\u064E\u0646\u064E\u0627 \u0645\u064E\u0643\u064E\u0627\u0646\u064E\u0647\u064F\u06E5\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 79, text: "\u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0639\u064E\u0627\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646 \u0646\u0651\u064E\u0623\u06E1\u062E\u064F\u0630\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627 \u0645\u064E\u062A\u064E\u0670\u0639\u064E\u0646\u064E\u0627 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0638\u064E\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 80, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u064A\u06E1\u0640\u0654\u064E\u0633\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F \u062E\u064E\u0644\u064E\u0635\u064F\u0648\u0627\u0652 \u0646\u064E\u062C\u0650\u064A\u0651\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0643\u064E\u0628\u0650\u064A\u0631\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0623\u064E\u0628\u064E\u0627\u0643\u064F\u0645\u06E1 \u0642\u064E\u062F\u06E1 \u0623\u064E\u062E\u064E\u0630\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u064E\u0648\u06E1\u062B\u0650\u0642\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0645\u064E\u0627 \u0641\u064E\u0631\u0651\u064E\u0637\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u064A\u064F\u0648\u0633\u064F\u0641\u064E\u06D6 \u0641\u064E\u0644\u064E\u0646\u06E1 \u0623\u064E\u0628\u06E1\u0631\u064E\u062D\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0623\u06E1\u0630\u064E\u0646\u064E \u0644\u0650\u064A\u0653 \u0623\u064E\u0628\u0650\u064A\u0653 \u0623\u064E\u0648\u06E1 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u062D\u064E\u0670\u0643\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 81, text: "\u0671\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0628\u0650\u064A\u0643\u064F\u0645\u06E1 \u0641\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u0627\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0628\u06E1\u0646\u064E\u0643\u064E \u0633\u064E\u0631\u064E\u0642\u064E \u0648\u064E\u0645\u064E\u0627 \u0634\u064E\u0647\u0650\u062F\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0644\u0650\u0645\u06E1\u0646\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0644\u0650\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u062D\u064E\u0670\u0641\u0650\u0638\u0650\u064A\u0646\u064E" }, { id: 82, text: "\u0648\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u0650 \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064F\u0646\u0651\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0639\u0650\u064A\u0631\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u0642\u06E1\u0628\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0635\u064E\u0670\u062F\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0642\u064E\u0627\u0644\u064E \u0628\u064E\u0644\u06E1 \u0633\u064E\u0648\u0651\u064E\u0644\u064E\u062A\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0657\u0627\u06D6 \u0641\u064E\u0635\u064E\u0628\u06E1\u0631\u065E \u062C\u064E\u0645\u0650\u064A\u0644\u064C\u06D6 \u0639\u064E\u0633\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u0650\u064A \u0628\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 84, text: "\u0648\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0633\u064E\u0641\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649\u0670 \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0648\u064E\u0671\u0628\u06E1\u064A\u064E\u0636\u0651\u064E\u062A\u06E1 \u0639\u064E\u064A\u06E1\u0646\u064E\u0627\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064F\u0632\u06E1\u0646\u0650 \u0641\u064E\u0647\u064F\u0648\u064E \u0643\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 85, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062A\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0641\u06E1\u062A\u064E\u0624\u064F\u0627\u0652 \u062A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u062D\u064E\u0631\u064E\u0636\u064B\u0627 \u0623\u064E\u0648\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0647\u064E\u0670\u0644\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 86, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0634\u06E1\u0643\u064F\u0648\u0627\u0652 \u0628\u064E\u062B\u0651\u0650\u064A \u0648\u064E\u062D\u064F\u0632\u06E1\u0646\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 87, text: "\u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0651\u064E \u0671\u0630\u06E1\u0647\u064E\u0628\u064F\u0648\u0627\u0652 \u0641\u064E\u062A\u064E\u062D\u064E\u0633\u0651\u064E\u0633\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0648\u064E\u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0627\u0652\u064A\u06E1\u0640\u0654\u064E\u0633\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0631\u0651\u064E\u0648\u06E1\u062D\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064E\u0627\u0652\u064A\u06E1\u0640\u0654\u064E\u0633\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0648\u06E1\u062D\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 88, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062F\u064E\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0645\u064E\u0633\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0646\u064E\u0627 \u0671\u0644\u0636\u0651\u064F\u0631\u0651\u064F \u0648\u064E\u062C\u0650\u0626\u06E1\u0646\u064E\u0627 \u0628\u0650\u0628\u0650\u0636\u064E\u0670\u0639\u064E\u0629\u0656 \u0645\u0651\u064F\u0632\u06E1\u062C\u064E\u0649\u0670\u0629\u0656 \u0641\u064E\u0623\u064E\u0648\u06E1\u0641\u0650 \u0644\u064E\u0646\u064E\u0627 \u0671\u0644\u06E1\u0643\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u062A\u064E\u0635\u064E\u062F\u0651\u064E\u0642\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0635\u064E\u062F\u0651\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 89, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0644\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u06E1\u062A\u064F\u0645 \u0628\u0650\u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0648\u064E\u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u0625\u0650\u0630\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062C\u064E\u0670\u0647\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 90, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0623\u064E\u0646\u062A\u064E \u064A\u064F\u0648\u0633\u064F\u0641\u064F\u06D6 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0646\u064E\u0627\u06E0 \u064A\u064F\u0648\u0633\u064F\u0641\u064F \u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0623\u064E\u062E\u0650\u064A\u06D6 \u0642\u064E\u062F\u06E1 \u0645\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u0642\u0650 \u0648\u064E\u064A\u064E\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u0636\u0650\u064A\u0639\u064F \u0623\u064E\u062C\u06E1\u0631\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 91, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062A\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062B\u064E\u0631\u064E\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E\u0627 \u0644\u064E\u062E\u064E\u0670\u0637\u0650\u0640\u0654\u0650\u064A\u0646\u064E" }, { id: 92, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0627 \u062A\u064E\u062B\u06E1\u0631\u0650\u064A\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E\u06D6 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0631\u06E1\u062D\u064E\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u062D\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 93, text: "\u0671\u0630\u06E1\u0647\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0642\u064E\u0645\u0650\u064A\u0635\u0650\u064A \u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u064F\u0648\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u062C\u06E1\u0647\u0650 \u0623\u064E\u0628\u0650\u064A \u064A\u064E\u0623\u06E1\u062A\u0650 \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0628\u0650\u0623\u064E\u0647\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 94, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0641\u064E\u0635\u064E\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u0639\u0650\u064A\u0631\u064F \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0628\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0623\u064E\u062C\u0650\u062F\u064F \u0631\u0650\u064A\u062D\u064E \u064A\u064F\u0648\u0633\u064F\u0641\u064E\u06D6 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064F\u0641\u064E\u0646\u0651\u0650\u062F\u064F\u0648\u0646\u0650" }, { id: 95, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062A\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0642\u064E\u062F\u0650\u064A\u0645\u0650" }, { id: 96, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u06E1\u0628\u064E\u0634\u0650\u064A\u0631\u064F \u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u062C\u06E1\u0647\u0650\u0647\u0650\u06E6 \u0641\u064E\u0671\u0631\u06E1\u062A\u064E\u062F\u0651\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0644\u064E\u0645\u06E1 \u0623\u064E\u0642\u064F\u0644 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u0627\u0646\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0630\u064F\u0646\u064F\u0648\u0628\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u062E\u064E\u0670\u0637\u0650\u0640\u0654\u0650\u064A\u0646\u064E" }, { id: 98, text: "\u0642\u064E\u0627\u0644\u064E \u0633\u064E\u0648\u06E1\u0641\u064E \u0623\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u0650\u064A\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 99, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062F\u064E\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u064A\u064F\u0648\u0633\u064F\u0641\u064E \u0621\u064E\u0627\u0648\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0628\u064E\u0648\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0635\u06E1\u0631\u064E \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0621\u064E\u0627\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 100, text: "\u0648\u064E\u0631\u064E\u0641\u064E\u0639\u064E \u0623\u064E\u0628\u064E\u0648\u064E\u064A\u06E1\u0647\u0650 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0648\u064E\u062E\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u062A\u0650 \u0647\u064E\u0670\u0630\u064E\u0627 \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u064F \u0631\u064F\u0621\u06E1\u064A\u064E\u0670\u064A\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0642\u064E\u062F\u06E1 \u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064E\u0627 \u0631\u064E\u0628\u0651\u0650\u064A \u062D\u064E\u0642\u0651\u0657\u0627\u06D6 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0628\u0650\u064A\u0653 \u0625\u0650\u0630\u06E1 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u0650\u062C\u06E1\u0646\u0650 \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u062F\u06E1\u0648\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0623\u064E\u0646 \u0646\u0651\u064E\u0632\u064E\u063A\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E \u0625\u0650\u062E\u06E1\u0648\u064E\u062A\u0650\u064A\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u0637\u0650\u064A\u0641\u065E \u0644\u0651\u0650\u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 101, text: "\u06DE\u0631\u064E\u0628\u0651\u0650 \u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u0650 \u0648\u064E\u0639\u064E\u0644\u0651\u064E\u0645\u06E1\u062A\u064E\u0646\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u0650 \u0671\u0644\u06E1\u0623\u064E\u062D\u064E\u0627\u062F\u0650\u064A\u062B\u0650\u06DA \u0641\u064E\u0627\u0637\u0650\u0631\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0646\u062A\u064E \u0648\u064E\u0644\u0650\u064A\u0651\u0650\u06E6 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D6 \u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0646\u0650\u064A \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0657\u0627 \u0648\u064E\u0623\u064E\u0644\u06E1\u062D\u0650\u0642\u06E1\u0646\u0650\u064A \u0628\u0650\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 102, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0646\u064F\u0648\u062D\u0650\u064A\u0647\u0650 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u0644\u064E\u062F\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 103, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0648\u06E1 \u062D\u064E\u0631\u064E\u0635\u06E1\u062A\u064E \u0628\u0650\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 104, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064D\u06DA \u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 105, text: "\u0648\u064E\u0643\u064E\u0623\u064E\u064A\u0651\u0650\u0646 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u0656 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u064A\u064E\u0645\u064F\u0631\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0645\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 106, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 107, text: "\u0623\u064E\u0641\u064E\u0623\u064E\u0645\u0650\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u063A\u064E\u0670\u0634\u0650\u064A\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0648\u06E1 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 108, text: "\u0642\u064F\u0644\u06E1 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u064A\u0653 \u0623\u064E\u062F\u06E1\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0635\u0650\u064A\u0631\u064E\u0629\u064D \u0623\u064E\u0646\u064E\u0627\u06E0 \u0648\u064E\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E\u0646\u0650\u064A\u06D6 \u0648\u064E\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 109, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u0650\u062C\u064E\u0627\u0644\u0657\u0627 \u0646\u0651\u064F\u0648\u062D\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670\u0653\u06D7 \u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0644\u064E\u062F\u064E\u0627\u0631\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 110, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u064A\u06E1\u0640\u0654\u064E\u0633\u064E \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064F \u0648\u064E\u0638\u064E\u0646\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u062F\u06E1 \u0643\u064F\u0630\u0650\u0628\u064F\u0648\u0627\u0652 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0635\u06E1\u0631\u064F\u0646\u064E\u0627 \u0641\u064E\u0646\u064F\u062C\u0651\u0650\u064A\u064E \u0645\u064E\u0646 \u0646\u0651\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0631\u064E\u062F\u0651\u064F \u0628\u064E\u0623\u06E1\u0633\u064F\u0646\u064E\u0627 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 111, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A \u0642\u064E\u0635\u064E\u0635\u0650\u0647\u0650\u0645\u06E1 \u0639\u0650\u0628\u06E1\u0631\u064E\u0629\u065E \u0644\u0651\u0650\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650\u06D7 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u062D\u064E\u062F\u0650\u064A\u062B\u0657\u0627 \u064A\u064F\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u062A\u064E\u0635\u06E1\u062F\u0650\u064A\u0642\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u062A\u064E\u0641\u06E1\u0635\u0650\u064A\u0644\u064E \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }] }, { id: 13, name: "\u0627\u0644\u0631\u0639\u062F", transliteration: "Ar-Ra'd", type: "medinan", total_verses: 43, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0645\u0653\u0631\u06DA \u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650\u06D7 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 2, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0631\u064E\u0641\u064E\u0639\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u064E\u0645\u064E\u062F\u0656 \u062A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E\u0647\u064E\u0627\u06D6 \u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650\u06D6 \u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E\u06D6 \u0643\u064F\u0644\u0651\u065E \u064A\u064E\u062C\u06E1\u0631\u0650\u064A \u0644\u0650\u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649\u06DA \u064A\u064F\u062F\u064E\u0628\u0651\u0650\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064E \u064A\u064F\u0641\u064E\u0635\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645 \u0628\u0650\u0644\u0650\u0642\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u062A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0645\u064E\u062F\u0651\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0631\u064E\u0648\u064E\u0670\u0633\u0650\u064A\u064E \u0648\u064E\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u0657\u0627\u06D6 \u0648\u064E\u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u062C\u064E\u0639\u064E\u0644\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0632\u064E\u0648\u06E1\u062C\u064E\u064A\u06E1\u0646\u0650 \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650\u06D6 \u064A\u064F\u063A\u06E1\u0634\u0650\u064A \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0642\u0650\u0637\u064E\u0639\u065E \u0645\u0651\u064F\u062A\u064E\u062C\u064E\u0670\u0648\u0650\u0631\u064E\u0670\u062A\u065E \u0648\u064E\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0646\u064E\u0670\u0628\u0656 \u0648\u064E\u0632\u064E\u0631\u06E1\u0639\u065E \u0648\u064E\u0646\u064E\u062E\u0650\u064A\u0644\u065E \u0635\u0650\u0646\u06E1\u0648\u064E\u0627\u0646\u065E \u0648\u064E\u063A\u064E\u064A\u06E1\u0631\u064F \u0635\u0650\u0646\u06E1\u0648\u064E\u0627\u0646\u0656 \u064A\u064F\u0633\u06E1\u0642\u064E\u0649\u0670 \u0628\u0650\u0645\u064E\u0627\u0653\u0621\u0656 \u0648\u064E\u0670\u062D\u0650\u062F\u0656 \u0648\u064E\u0646\u064F\u0641\u064E\u0636\u0651\u0650\u0644\u064F \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064F\u0643\u064F\u0644\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u06DE\u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0639\u06E1\u062C\u064E\u0628\u06E1 \u0641\u064E\u0639\u064E\u062C\u064E\u0628\u065E \u0642\u064E\u0648\u06E1\u0644\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u062A\u064F\u0631\u064E\u0670\u0628\u064B\u0627 \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0641\u0650\u064A \u062E\u064E\u0644\u06E1\u0642\u0656 \u062C\u064E\u062F\u0650\u064A\u062F\u064D\u06D7 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u063A\u06E1\u0644\u064E\u0670\u0644\u064F \u0641\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0646\u064E\u0627\u0642\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0628\u0650\u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0650 \u0642\u064E\u0628\u06E1\u0644\u064E \u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0650 \u0648\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u062B\u064F\u0644\u064E\u0670\u062A\u064F\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0630\u064F\u0648 \u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0656 \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0639\u064E\u0644\u064E\u0649\u0670 \u0638\u064F\u0644\u06E1\u0645\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 7, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u064A\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u0653\u06D7 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0645\u064F\u0646\u0630\u0650\u0631\u065E\u06D6 \u0648\u064E\u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0642\u064E\u0648\u06E1\u0645\u064D \u0647\u064E\u0627\u062F\u064D" }, { id: 8, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F \u0643\u064F\u0644\u0651\u064F \u0623\u064F\u0646\u062B\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u063A\u0650\u064A\u0636\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u064F \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0632\u06E1\u062F\u064E\u0627\u062F\u064F\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u064F \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0628\u0650\u0645\u0650\u0642\u06E1\u062F\u064E\u0627\u0631\u064D" }, { id: 9, text: "\u0639\u064E\u0670\u0644\u0650\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650 \u0671\u0644\u06E1\u0643\u064E\u0628\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0639\u064E\u0627\u0644\u0650" }, { id: 10, text: "\u0633\u064E\u0648\u064E\u0627\u0653\u0621\u065E \u0645\u0651\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0623\u064E\u0633\u064E\u0631\u0651\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064E \u0648\u064E\u0645\u064E\u0646 \u062C\u064E\u0647\u064E\u0631\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0645\u064F\u0633\u06E1\u062A\u064E\u062E\u06E1\u0641\u0650\u06ED \u0628\u0650\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0633\u064E\u0627\u0631\u0650\u0628\u064F\u06E2 \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650" }, { id: 11, text: "\u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0639\u064E\u0642\u0651\u0650\u0628\u064E\u0670\u062A\u065E \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650 \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u0650\u0647\u0650\u06E6 \u064A\u064E\u062D\u06E1\u0641\u064E\u0638\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u063A\u064E\u064A\u0651\u0650\u0631\u064F \u0645\u064E\u0627 \u0628\u0650\u0642\u064E\u0648\u06E1\u0645\u064D \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u063A\u064E\u064A\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0628\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u0633\u064F\u0648\u0653\u0621\u0657\u0627 \u0641\u064E\u0644\u064E\u0627 \u0645\u064E\u0631\u064E\u062F\u0651\u064E \u0644\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0648\u064E\u0627\u0644\u064D" }, { id: 12, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0631\u0650\u064A\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u0631\u06E1\u0642\u064E \u062E\u064E\u0648\u06E1\u0641\u0657\u0627 \u0648\u064E\u0637\u064E\u0645\u064E\u0639\u0657\u0627 \u0648\u064E\u064A\u064F\u0646\u0634\u0650\u0626\u064F \u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0627\u0628\u064E \u0671\u0644\u062B\u0651\u0650\u0642\u064E\u0627\u0644\u064E" }, { id: 13, text: "\u0648\u064E\u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F \u0671\u0644\u0631\u0651\u064E\u0639\u06E1\u062F\u064F \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0645\u0650\u0646\u06E1 \u062E\u0650\u064A\u0641\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064F \u0671\u0644\u0635\u0651\u064E\u0648\u064E\u0670\u0639\u0650\u0642\u064E \u0641\u064E\u064A\u064F\u0635\u0650\u064A\u0628\u064F \u0628\u0650\u0647\u064E\u0627 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0645\u0650\u062D\u064E\u0627\u0644\u0650" }, { id: 14, text: "\u0644\u064E\u0647\u064F\u06E5 \u062F\u064E\u0639\u06E1\u0648\u064E\u0629\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0634\u064E\u064A\u06E1\u0621\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0628\u064E\u0670\u0633\u0650\u0637\u0650 \u0643\u064E\u0641\u0651\u064E\u064A\u06E1\u0647\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u0650 \u0644\u0650\u064A\u064E\u0628\u06E1\u0644\u064F\u063A\u064E \u0641\u064E\u0627\u0647\u064F \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0628\u0650\u0628\u064E\u0670\u0644\u0650\u063A\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0645\u064E\u0627 \u062F\u064F\u0639\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656" }, { id: 15, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06E4 \u064A\u064E\u0633\u06E1\u062C\u064F\u062F\u064F\u06E4 \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0637\u064E\u0648\u06E1\u0639\u0657\u0627 \u0648\u064E\u0643\u064E\u0631\u06E1\u0647\u0657\u0627 \u0648\u064E\u0638\u0650\u0644\u064E\u0670\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u063A\u064F\u062F\u064F\u0648\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u0635\u064E\u0627\u0644\u0650\u06E9" }, { id: 16, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646 \u0631\u0651\u064E\u0628\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0642\u064F\u0644\u06E1 \u0623\u064E\u0641\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0644\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0646\u064E\u0641\u06E1\u0639\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0636\u064E\u0631\u0651\u0657\u0627\u06DA \u0642\u064F\u0644\u06E1 \u0647\u064E\u0644\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0635\u0650\u064A\u0631\u064F \u0623\u064E\u0645\u06E1 \u0647\u064E\u0644\u06E1 \u062A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u064F \u0648\u064E\u0671\u0644\u0646\u0651\u064F\u0648\u0631\u064F\u06D7 \u0623\u064E\u0645\u06E1 \u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E \u062E\u064E\u0644\u064E\u0642\u064F\u0648\u0627\u0652 \u0643\u064E\u062E\u064E\u0644\u06E1\u0642\u0650\u0647\u0650\u06E6 \u0641\u064E\u062A\u064E\u0634\u064E\u0670\u0628\u064E\u0647\u064E \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u0670\u0644\u0650\u0642\u064F \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0648\u064E\u0670\u062D\u0650\u062F\u064F \u0671\u0644\u06E1\u0642\u064E\u0647\u0651\u064E\u0640\u0670\u0631\u064F" }, { id: 17, text: "\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0633\u064E\u0627\u0644\u064E\u062A\u06E1 \u0623\u064E\u0648\u06E1\u062F\u0650\u064A\u064E\u0629\u064F\u06E2 \u0628\u0650\u0642\u064E\u062F\u064E\u0631\u0650\u0647\u064E\u0627 \u0641\u064E\u0671\u062D\u06E1\u062A\u064E\u0645\u064E\u0644\u064E \u0671\u0644\u0633\u0651\u064E\u064A\u06E1\u0644\u064F \u0632\u064E\u0628\u064E\u062F\u0657\u0627 \u0631\u0651\u064E\u0627\u0628\u0650\u064A\u0657\u0627\u06D6 \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627 \u064A\u064F\u0648\u0642\u0650\u062F\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u062D\u0650\u0644\u06E1\u064A\u064E\u0629\u064D \u0623\u064E\u0648\u06E1 \u0645\u064E\u062A\u064E\u0670\u0639\u0656 \u0632\u064E\u0628\u064E\u062F\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0647\u064F\u06E5\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u064E\u06DA \u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0632\u0651\u064E\u0628\u064E\u062F\u064F \u0641\u064E\u064A\u064E\u0630\u06E1\u0647\u064E\u0628\u064F \u062C\u064F\u0641\u064E\u0627\u0653\u0621\u0657\u06D6 \u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0641\u064E\u064A\u064E\u0645\u06E1\u0643\u064F\u062B\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u062B\u064E\u0627\u0644\u064E" }, { id: 18, text: "\u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0648\u064E\u0645\u0650\u062B\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0644\u064E\u0671\u0641\u06E1\u062A\u064E\u062F\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u0653\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064F \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650 \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u0650\u0647\u064E\u0627\u062F\u064F" }, { id: 19, text: "\u06DE\u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0643\u064E\u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 20, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0648\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0639\u064E\u0647\u06E1\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0646\u0642\u064F\u0636\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E" }, { id: 21, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0635\u0650\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u064E\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646 \u064A\u064F\u0648\u0635\u064E\u0644\u064E \u0648\u064E\u064A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0633\u064F\u0648\u0653\u0621\u064E \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 22, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u062C\u06E1\u0647\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0633\u0650\u0631\u0651\u0657\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u0657 \u0648\u064E\u064A\u064E\u062F\u06E1\u0631\u064E\u0621\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0650 \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u064E \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064F\u0642\u06E1\u0628\u064E\u0649 \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u0650" }, { id: 23, text: "\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u064F \u0639\u064E\u062F\u06E1\u0646\u0656 \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0646 \u0635\u064E\u0644\u064E\u062D\u064E \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0640\u0670\u062A\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0628\u064E\u0627\u0628\u0656" }, { id: 24, text: "\u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0635\u064E\u0628\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1\u06DA \u0641\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u0639\u064F\u0642\u06E1\u0628\u064E\u0649 \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u0650" }, { id: 25, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0646\u0642\u064F\u0636\u064F\u0648\u0646\u064E \u0639\u064E\u0647\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0642\u06E1\u0637\u064E\u0639\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u064E\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646 \u064A\u064F\u0648\u0635\u064E\u0644\u064E \u0648\u064E\u064A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0639\u06E1\u0646\u064E\u0629\u064F \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064F \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u0650" }, { id: 26, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u06DA \u0648\u064E\u0641\u064E\u0631\u0650\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u062A\u064E\u0670\u0639\u065E" }, { id: 27, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u064A\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06DA \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0636\u0650\u0644\u0651\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0646\u064E\u0627\u0628\u064E" }, { id: 28, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u0637\u06E1\u0645\u064E\u0626\u0650\u0646\u0651\u064F \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645 \u0628\u0650\u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0623\u064E\u0644\u064E\u0627 \u0628\u0650\u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0637\u06E1\u0645\u064E\u0626\u0650\u0646\u0651\u064F \u0671\u0644\u06E1\u0642\u064F\u0644\u064F\u0648\u0628\u064F" }, { id: 29, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0637\u064F\u0648\u0628\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u062D\u064F\u0633\u06E1\u0646\u064F \u0645\u064E\u0640\u0654\u064E\u0627\u0628\u0656" }, { id: 30, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0641\u0650\u064A\u0653 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u064E\u0627\u0653 \u0623\u064F\u0645\u064E\u0645\u065E \u0644\u0651\u0650\u062A\u064E\u062A\u06E1\u0644\u064F\u0648\u064E\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650\u06DA \u0642\u064F\u0644\u06E1 \u0647\u064F\u0648\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u062A\u064F \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u062A\u064E\u0627\u0628\u0650" }, { id: 31, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0657\u0627 \u0633\u064F\u064A\u0651\u0650\u0631\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0623\u064E\u0648\u06E1 \u0642\u064F\u0637\u0651\u0650\u0639\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0623\u064E\u0648\u06E1 \u0643\u064F\u0644\u0651\u0650\u0645\u064E \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670\u06D7 \u0628\u064E\u0644 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627\u06D7 \u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0627\u0652\u064A\u06E1\u0640\u0654\u064E\u0633\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u0644\u0651\u064E\u0648\u06E1 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064E\u062F\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627\u06D7 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0632\u064E\u0627\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u062A\u064F\u0635\u0650\u064A\u0628\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0635\u064E\u0646\u064E\u0639\u064F\u0648\u0627\u0652 \u0642\u064E\u0627\u0631\u0650\u0639\u064E\u0629\u064C \u0623\u064E\u0648\u06E1 \u062A\u064E\u062D\u064F\u0644\u0651\u064F \u0642\u064E\u0631\u0650\u064A\u0628\u0657\u0627 \u0645\u0651\u0650\u0646 \u062F\u064E\u0627\u0631\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0648\u064E\u0639\u06E1\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062E\u06E1\u0644\u0650\u0641\u064F \u0671\u0644\u06E1\u0645\u0650\u064A\u0639\u064E\u0627\u062F\u064E" }, { id: 32, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u0650 \u0671\u0633\u06E1\u062A\u064F\u0647\u06E1\u0632\u0650\u0626\u064E \u0628\u0650\u0631\u064F\u0633\u064F\u0644\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0641\u064E\u0623\u064E\u0645\u06E1\u0644\u064E\u064A\u06E1\u062A\u064F \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 33, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0646\u064E\u0641\u06E1\u0633\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1\u06D7 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E \u0642\u064F\u0644\u06E1 \u0633\u064E\u0645\u0651\u064F\u0648\u0647\u064F\u0645\u06E1\u06DA \u0623\u064E\u0645\u06E1 \u062A\u064F\u0646\u064E\u0628\u0651\u0650\u0640\u0654\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0645 \u0628\u0650\u0638\u064E\u0670\u0647\u0650\u0631\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650\u06D7 \u0628\u064E\u0644\u06E1 \u0632\u064F\u064A\u0651\u0650\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0643\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0647\u064E\u0627\u062F\u0656" }, { id: 34, text: "\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0644\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0623\u064E\u0634\u064E\u0642\u0651\u064F\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0648\u064E\u0627\u0642\u0656" }, { id: 35, text: "\u06DE\u0645\u0651\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0648\u064F\u0639\u0650\u062F\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E\u06D6 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06D6 \u0623\u064F\u0643\u064F\u0644\u064F\u0647\u064E\u0627 \u062F\u064E\u0627\u0653\u0626\u0650\u0645\u065E \u0648\u064E\u0638\u0650\u0644\u0651\u064F\u0647\u064E\u0627\u06DA \u062A\u0650\u0644\u06E1\u0643\u064E \u0639\u064F\u0642\u06E1\u0628\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u0627\u0652\u06DA \u0648\u0651\u064E\u0639\u064F\u0642\u06E1\u0628\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F" }, { id: 36, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u064A\u064E\u0641\u06E1\u0631\u064E\u062D\u064F\u0648\u0646\u064E \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u0650 \u0645\u064E\u0646 \u064A\u064F\u0646\u0643\u0650\u0631\u064F \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u06E5\u06DA \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064F\u0634\u06E1\u0631\u0650\u0643\u064E \u0628\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0640\u0654\u064E\u0627\u0628\u0650" }, { id: 37, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u062D\u064F\u0643\u06E1\u0645\u064B\u0627 \u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u0657\u0627\u06DA \u0648\u064E\u0644\u064E\u0626\u0650\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u06E1\u062A\u064E \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u0645\u064E\u0627 \u0644\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u0648\u064E\u0627\u0642\u0656" }, { id: 38, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0631\u064F\u0633\u064F\u0644\u0657\u0627 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u0648\u064E\u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u0657\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0631\u064E\u0633\u064F\u0648\u0644\u064D \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0623\u064E\u062C\u064E\u0644\u0656 \u0643\u0650\u062A\u064E\u0627\u0628\u065E" }, { id: 39, text: "\u064A\u064E\u0645\u06E1\u062D\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064F\u062B\u06E1\u0628\u0650\u062A\u064F\u06D6 \u0648\u064E\u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5\u0653 \u0623\u064F\u0645\u0651\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650" }, { id: 40, text: "\u0648\u064E\u0625\u0650\u0646 \u0645\u0651\u064E\u0627 \u0646\u064F\u0631\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0628\u064E\u0639\u06E1\u0636\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0646\u064E\u0639\u0650\u062F\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0646\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F \u0648\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u064F" }, { id: 41, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0627 \u0646\u064E\u0623\u06E1\u062A\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0646\u064E\u0646\u0642\u064F\u0635\u064F\u0647\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0637\u06E1\u0631\u064E\u0627\u0641\u0650\u0647\u064E\u0627\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0644\u064E\u0627 \u0645\u064F\u0639\u064E\u0642\u0651\u0650\u0628\u064E \u0644\u0650\u062D\u064F\u0643\u06E1\u0645\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0633\u064E\u0631\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 42, text: "\u0648\u064E\u0642\u064E\u062F\u06E1 \u0645\u064E\u0643\u064E\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0643\u06E1\u0631\u064F \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627\u06D6 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656\u06D7 \u0648\u064E\u0633\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0640\u0670\u0631\u064F \u0644\u0650\u0645\u064E\u0646\u06E1 \u0639\u064F\u0642\u06E1\u0628\u064E\u0649 \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u0650" }, { id: 43, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0633\u06E1\u062A\u064E \u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0657\u0627\u06DA \u0642\u064F\u0644\u06E1 \u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u0647\u0650\u064A\u062F\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0639\u0650\u0644\u06E1\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650" }] }, { id: 14, name: "\u0627\u0628\u0631\u0627\u0647\u064A\u0645", transliteration: "Ibrahim", type: "meccan", total_verses: 52, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0631\u06DA \u0643\u0650\u062A\u064E\u0670\u0628\u064C \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0644\u0650\u062A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064F\u0648\u0631\u0650 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u062F\u0650" }, { id: 2, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0656 \u0634\u064E\u062F\u0650\u064A\u062F\u064D" }, { id: 3, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0633\u06E1\u062A\u064E\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0639\u0650\u0648\u064E\u062C\u064B\u0627\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0650\u06ED \u0628\u064E\u0639\u0650\u064A\u062F\u0656" }, { id: 4, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0644\u0650\u0633\u064E\u0627\u0646\u0650 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0644\u0650\u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u064A\u064F\u0636\u0650\u0644\u0651\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 5, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u062E\u06E1\u0631\u0650\u062C\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064F\u0648\u0631\u0650 \u0648\u064E\u0630\u064E\u0643\u0651\u0650\u0631\u06E1\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u064A\u0651\u064E\u0649\u0670\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0635\u064E\u0628\u0651\u064E\u0627\u0631\u0656 \u0634\u064E\u0643\u064F\u0648\u0631\u0656" }, { id: 6, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650 \u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u0623\u064E\u0646\u062C\u064E\u0649\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u0644\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u064A\u064E\u0633\u064F\u0648\u0645\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0648\u064E\u064A\u064F\u0630\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0646\u064E \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062D\u06E1\u064A\u064F\u0648\u0646\u064E \u0646\u0650\u0633\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645 \u0628\u064E\u0644\u064E\u0627\u0653\u0621\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 7, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u062A\u064E\u0623\u064E\u0630\u0651\u064E\u0646\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0644\u064E\u0626\u0650\u0646 \u0634\u064E\u0643\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0623\u064E\u0632\u0650\u064A\u062F\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0643\u064E\u0641\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u0650\u064A \u0644\u064E\u0634\u064E\u062F\u0650\u064A\u062F\u065E" }, { id: 8, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u063A\u064E\u0646\u0650\u064A\u0651\u064C \u062D\u064E\u0645\u0650\u064A\u062F\u064C" }, { id: 9, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u0643\u064F\u0645\u06E1 \u0646\u064E\u0628\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u0650 \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0639\u064E\u0627\u062F\u0656 \u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0631\u064E\u062F\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064E\u0641\u064E\u0631\u06E1\u0646\u064E\u0627 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064F\u0631\u0650\u064A\u0628\u0656" }, { id: 10, text: "\u06DE\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u0643\u0651\u065E \u0641\u064E\u0627\u0637\u0650\u0631\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0643\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u0624\u064E\u062E\u0651\u0650\u0631\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0646\u064E\u0627 \u062A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u062A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E\u0627 \u0639\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E\u0627 \u0628\u0650\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 11, text: "\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0646\u0651\u064E\u062D\u06E1\u0646\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0645\u064F\u0646\u0651\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0643\u064F\u0645 \u0628\u0650\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0644\u0651\u064E\u0627 \u0646\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0647\u064E\u062F\u064E\u0649\u0670\u0646\u064E\u0627 \u0633\u064F\u0628\u064F\u0644\u064E\u0646\u064E\u0627\u06DA \u0648\u064E\u0644\u064E\u0646\u064E\u0635\u06E1\u0628\u0650\u0631\u064E\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u0630\u064E\u064A\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E\u0627\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0648\u064E\u0643\u0651\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0646\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0636\u0650\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0644\u064E\u062A\u064E\u0639\u064F\u0648\u062F\u064F\u0646\u0651\u064E \u0641\u0650\u064A \u0645\u0650\u0644\u0651\u064E\u062A\u0650\u0646\u064E\u0627\u06D6 \u0641\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0646\u064F\u0647\u06E1\u0644\u0650\u0643\u064E\u0646\u0651\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0644\u064E\u0646\u064F\u0633\u06E1\u0643\u0650\u0646\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u0645\u064E\u0646\u06E1 \u062E\u064E\u0627\u0641\u064E \u0645\u064E\u0642\u064E\u0627\u0645\u0650\u064A \u0648\u064E\u062E\u064E\u0627\u0641\u064E \u0648\u064E\u0639\u0650\u064A\u062F\u0650" }, { id: 15, text: "\u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0641\u06E1\u062A\u064E\u062D\u064F\u0648\u0627\u0652 \u0648\u064E\u062E\u064E\u0627\u0628\u064E \u0643\u064F\u0644\u0651\u064F \u062C\u064E\u0628\u0651\u064E\u0627\u0631\u064D \u0639\u064E\u0646\u0650\u064A\u062F\u0656" }, { id: 16, text: "\u0645\u0651\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u06E6 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F \u0648\u064E\u064A\u064F\u0633\u06E1\u0642\u064E\u0649\u0670 \u0645\u0650\u0646 \u0645\u0651\u064E\u0627\u0653\u0621\u0656 \u0635\u064E\u062F\u0650\u064A\u062F\u0656" }, { id: 17, text: "\u064A\u064E\u062A\u064E\u062C\u064E\u0631\u0651\u064E\u0639\u064F\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0643\u064E\u0627\u062F\u064F \u064A\u064F\u0633\u0650\u064A\u063A\u064F\u0647\u064F\u06E5 \u0648\u064E\u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u0643\u064E\u0627\u0646\u0656 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0628\u0650\u0645\u064E\u064A\u0651\u0650\u062A\u0656\u06D6 \u0648\u064E\u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u06E6 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u063A\u064E\u0644\u0650\u064A\u0638\u065E" }, { id: 18, text: "\u0645\u0651\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0643\u064E\u0631\u064E\u0645\u064E\u0627\u062F\u064D \u0671\u0634\u06E1\u062A\u064E\u062F\u0651\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650 \u0671\u0644\u0631\u0651\u0650\u064A\u062D\u064F \u0641\u0650\u064A \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0627\u0635\u0650\u0641\u0656\u06D6 \u0644\u0651\u064E\u0627 \u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u0648\u0646\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u0636\u0651\u064E\u0644\u064E\u0670\u0644\u064F \u0671\u0644\u06E1\u0628\u064E\u0639\u0650\u064A\u062F\u064F" }, { id: 19, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0625\u0650\u0646 \u064A\u064E\u0634\u064E\u0623\u06E1 \u064A\u064F\u0630\u06E1\u0647\u0650\u0628\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u062E\u064E\u0644\u06E1\u0642\u0656 \u062C\u064E\u062F\u0650\u064A\u062F\u0656" }, { id: 20, text: "\u0648\u064E\u0645\u064E\u0627 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0639\u064E\u0632\u0650\u064A\u0632\u0656" }, { id: 21, text: "\u0648\u064E\u0628\u064E\u0631\u064E\u0632\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0636\u0651\u064F\u0639\u064E\u0641\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0628\u064E\u0639\u0657\u0627 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u063A\u06E1\u0646\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u0651\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0647\u064E\u062F\u064E\u0649\u0670\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1\u06D6 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u062C\u064E\u0632\u0650\u0639\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1 \u0635\u064E\u0628\u064E\u0631\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0644\u064E\u0646\u064E\u0627 \u0645\u0650\u0646 \u0645\u0651\u064E\u062D\u0650\u064A\u0635\u0656" }, { id: 22, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0644\u064E\u0645\u0651\u064E\u0627 \u0642\u064F\u0636\u0650\u064A\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0639\u064E\u062F\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0648\u064E\u0639\u064E\u062F\u062A\u0651\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u062E\u06E1\u0644\u064E\u0641\u06E1\u062A\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u064A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u064D \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062F\u064E\u0639\u064E\u0648\u06E1\u062A\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0644\u0650\u064A\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0644\u064F\u0648\u0645\u064F\u0648\u0646\u0650\u064A \u0648\u064E\u0644\u064F\u0648\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06D6 \u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0628\u0650\u0645\u064F\u0635\u06E1\u0631\u0650\u062E\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0645\u064F\u0635\u06E1\u0631\u0650\u062E\u0650\u064A\u0651\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0643\u064E\u0641\u064E\u0631\u06E1\u062A\u064F \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u0650 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 23, text: "\u0648\u064E\u0623\u064F\u062F\u06E1\u062E\u0650\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D6 \u062A\u064E\u062D\u0650\u064A\u0651\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0633\u064E\u0644\u064E\u0670\u0645\u064C" }, { id: 24, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0643\u064E\u064A\u06E1\u0641\u064E \u0636\u064E\u0631\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u0657 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0629\u0657 \u0643\u064E\u0634\u064E\u062C\u064E\u0631\u064E\u0629\u0656 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0629\u064D \u0623\u064E\u0635\u06E1\u0644\u064F\u0647\u064E\u0627 \u062B\u064E\u0627\u0628\u0650\u062A\u065E \u0648\u064E\u0641\u064E\u0631\u06E1\u0639\u064F\u0647\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650" }, { id: 25, text: "\u062A\u064F\u0624\u06E1\u062A\u0650\u064A\u0653 \u0623\u064F\u0643\u064F\u0644\u064E\u0647\u064E\u0627 \u0643\u064F\u0644\u0651\u064E \u062D\u0650\u064A\u0646\u0650\u06ED \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u064E\u0627\u06D7 \u0648\u064E\u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u062B\u064E\u0627\u0644\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0648\u064E\u0645\u064E\u062B\u064E\u0644\u064F \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064D \u062E\u064E\u0628\u0650\u064A\u062B\u064E\u0629\u0656 \u0643\u064E\u0634\u064E\u062C\u064E\u0631\u064E\u0629\u064D \u062E\u064E\u0628\u0650\u064A\u062B\u064E\u0629\u064D \u0671\u062C\u06E1\u062A\u064F\u062B\u0651\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064E\u0627 \u0644\u064E\u0647\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0631\u064E\u0627\u0631\u0656" }, { id: 27, text: "\u064A\u064F\u062B\u064E\u0628\u0651\u0650\u062A\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u0671\u0644\u062B\u0651\u064E\u0627\u0628\u0650\u062A\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D6 \u0648\u064E\u064A\u064F\u0636\u0650\u0644\u0651\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E\u06DA \u0648\u064E\u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F" }, { id: 28, text: "\u06DE\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0628\u064E\u062F\u0651\u064E\u0644\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064F\u0641\u06E1\u0631\u0657\u0627 \u0648\u064E\u0623\u064E\u062D\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u0645\u06E1 \u062F\u064E\u0627\u0631\u064E \u0671\u0644\u06E1\u0628\u064E\u0648\u064E\u0627\u0631\u0650" }, { id: 29, text: "\u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u064A\u064E\u0635\u06E1\u0644\u064E\u0648\u06E1\u0646\u064E\u0647\u064E\u0627\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0642\u064E\u0631\u064E\u0627\u0631\u064F" }, { id: 30, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646\u062F\u064E\u0627\u062F\u0657\u0627 \u0644\u0651\u0650\u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6\u06D7 \u0642\u064F\u0644\u06E1 \u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0645\u064E\u0635\u0650\u064A\u0631\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 31, text: "\u0642\u064F\u0644 \u0644\u0651\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0633\u0650\u0631\u0651\u0657\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u064A\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u0628\u064E\u064A\u06E1\u0639\u065E \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u062E\u0650\u0644\u064E\u0670\u0644\u064C" }, { id: 32, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u064E \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u0631\u0650\u0632\u06E1\u0642\u0657\u0627 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064E \u0644\u0650\u062A\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064E" }, { id: 33, text: "\u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E \u062F\u064E\u0627\u0653\u0626\u0650\u0628\u064E\u064A\u06E1\u0646\u0650\u06D6 \u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E" }, { id: 34, text: "\u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u0627 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0639\u064F\u062F\u0651\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u062A\u064F\u062D\u06E1\u0635\u064F\u0648\u0647\u064E\u0627\u0653\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0644\u064E\u0638\u064E\u0644\u064F\u0648\u0645\u065E \u0643\u064E\u0641\u0651\u064E\u0627\u0631\u065E" }, { id: 35, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064F \u0631\u064E\u0628\u0651\u0650 \u0671\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u062F\u064E \u0621\u064E\u0627\u0645\u0650\u0646\u0657\u0627 \u0648\u064E\u0671\u062C\u06E1\u0646\u064F\u0628\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u0646\u0650\u064A\u0651\u064E \u0623\u064E\u0646 \u0646\u0651\u064E\u0639\u06E1\u0628\u064F\u062F\u064E \u0671\u0644\u06E1\u0623\u064E\u0635\u06E1\u0646\u064E\u0627\u0645\u064E" }, { id: 36, text: "\u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0646\u0651\u064E \u0623\u064E\u0636\u06E1\u0644\u064E\u0644\u06E1\u0646\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06D6 \u0641\u064E\u0645\u064E\u0646 \u062A\u064E\u0628\u0650\u0639\u064E\u0646\u0650\u064A \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u0651\u0650\u064A\u06D6 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0639\u064E\u0635\u064E\u0627\u0646\u0650\u064A \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 37, text: "\u0631\u0651\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0633\u06E1\u0643\u064E\u0646\u062A\u064F \u0645\u0650\u0646 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u0650\u064A \u0628\u0650\u0648\u064E\u0627\u062F\u064D \u063A\u064E\u064A\u06E1\u0631\u0650 \u0630\u0650\u064A \u0632\u064E\u0631\u06E1\u0639\u064D \u0639\u0650\u0646\u062F\u064E \u0628\u064E\u064A\u06E1\u062A\u0650\u0643\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u064E\u0631\u0651\u064E\u0645\u0650 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u0650\u064A\u064F\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0641\u064E\u0671\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u062A\u064E\u0647\u06E1\u0648\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0671\u0631\u06E1\u0632\u064F\u0642\u06E1\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0646\u064F\u062E\u06E1\u0641\u0650\u064A \u0648\u064E\u0645\u064E\u0627 \u0646\u064F\u0639\u06E1\u0644\u0650\u0646\u064F\u06D7 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062E\u06E1\u0641\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650" }, { id: 39, text: "\u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0648\u064E\u0647\u064E\u0628\u064E \u0644\u0650\u064A \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u0628\u064E\u0631\u0650 \u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u0633\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u062F\u0651\u064F\u0639\u064E\u0627\u0653\u0621\u0650" }, { id: 40, text: "\u0631\u064E\u0628\u0651\u0650 \u0671\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u0650\u064A \u0645\u064F\u0642\u0650\u064A\u0645\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0645\u0650\u0646 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u0650\u064A\u06DA \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u062A\u064E\u0642\u064E\u0628\u0651\u064E\u0644\u06E1 \u062F\u064F\u0639\u064E\u0627\u0653\u0621\u0650" }, { id: 41, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u0650\u064A \u0648\u064E\u0644\u0650\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u0651\u064E \u0648\u064E\u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0642\u064F\u0648\u0645\u064F \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u064F" }, { id: 42, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0670\u0641\u0650\u0644\u064B\u0627 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0624\u064E\u062E\u0651\u0650\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u0648\u06E1\u0645\u0656 \u062A\u064E\u0634\u06E1\u062E\u064E\u0635\u064F \u0641\u0650\u064A\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F" }, { id: 43, text: "\u0645\u064F\u0647\u06E1\u0637\u0650\u0639\u0650\u064A\u0646\u064E \u0645\u064F\u0642\u06E1\u0646\u0650\u0639\u0650\u064A \u0631\u064F\u0621\u064F\u0648\u0633\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062A\u064E\u062F\u0651\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0637\u064E\u0631\u06E1\u0641\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0647\u064E\u0648\u064E\u0627\u0653\u0621\u065E" }, { id: 44, text: "\u0648\u064E\u0623\u064E\u0646\u0630\u0650\u0631\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u062E\u0651\u0650\u0631\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0642\u064E\u0631\u0650\u064A\u0628\u0656 \u0646\u0651\u064F\u062C\u0650\u0628\u06E1 \u062F\u064E\u0639\u06E1\u0648\u064E\u062A\u064E\u0643\u064E \u0648\u064E\u0646\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u0650 \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064E\u06D7 \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0642\u06E1\u0633\u064E\u0645\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0632\u064E\u0648\u064E\u0627\u0644\u0656" }, { id: 45, text: "\u0648\u064E\u0633\u064E\u0643\u064E\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0645\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0641\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0636\u064E\u0631\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u062B\u064E\u0627\u0644\u064E" }, { id: 46, text: "\u0648\u064E\u0642\u064E\u062F\u06E1 \u0645\u064E\u0643\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0643\u06E1\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0643\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u0643\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u0650\u062A\u064E\u0632\u064F\u0648\u0644\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F" }, { id: 47, text: "\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u062E\u06E1\u0644\u0650\u0641\u064E \u0648\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0631\u064F\u0633\u064F\u0644\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u065E \u0630\u064F\u0648 \u0671\u0646\u062A\u0650\u0642\u064E\u0627\u0645\u0656" }, { id: 48, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064F\u0628\u064E\u062F\u0651\u064E\u0644\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u064F\u06D6 \u0648\u064E\u0628\u064E\u0631\u064E\u0632\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0648\u064E\u0670\u062D\u0650\u062F\u0650 \u0671\u0644\u06E1\u0642\u064E\u0647\u0651\u064E\u0627\u0631\u0650" }, { id: 49, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0645\u0651\u064F\u0642\u064E\u0631\u0651\u064E\u0646\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0635\u06E1\u0641\u064E\u0627\u062F\u0650" }, { id: 50, text: "\u0633\u064E\u0631\u064E\u0627\u0628\u0650\u064A\u0644\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0637\u0650\u0631\u064E\u0627\u0646\u0656 \u0648\u064E\u062A\u064E\u063A\u06E1\u0634\u064E\u0649\u0670 \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F" }, { id: 51, text: "\u0644\u0650\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0643\u064F\u0644\u0651\u064E \u0646\u064E\u0641\u06E1\u0633\u0656 \u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0631\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 52, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u0670\u063A\u065E \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u0650\u064A\u064F\u0646\u0630\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E \u0648\u064E\u0644\u0650\u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064E \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }] }, { id: 15, name: "\u0627\u0644\u062D\u062C\u0631", transliteration: "Al-Hijr", type: "meccan", total_verses: 99, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0631\u06DA \u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 2, text: "\u0631\u0651\u064F\u0628\u064E\u0645\u064E\u0627 \u064A\u064E\u0648\u064E\u062F\u0651\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 3, text: "\u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064F\u0644\u06E1\u0647\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u064E\u0644\u064F\u06D6 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u0644\u064E\u0647\u064E\u0627 \u0643\u0650\u062A\u064E\u0627\u0628\u065E \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u065E" }, { id: 5, text: "\u0645\u0651\u064E\u0627 \u062A\u064E\u0633\u06E1\u0628\u0650\u0642\u064F \u0645\u0650\u0646\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u064D \u0623\u064E\u062C\u064E\u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u062E\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0646\u064F\u0632\u0651\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064F \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0645\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u065E" }, { id: 7, text: "\u0644\u0651\u064E\u0648\u06E1\u0645\u064E\u0627 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u0645\u064E\u0627 \u0646\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u0657\u0627 \u0645\u0651\u064F\u0646\u0638\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0644\u064E\u062D\u064E\u0670\u0641\u0650\u0638\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0641\u0650\u064A \u0634\u0650\u064A\u064E\u0639\u0650 \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u0633\u06E1\u0644\u064F\u0643\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 13, text: "\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0633\u064F\u0646\u0651\u064E\u0629\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0641\u064E\u062A\u064E\u062D\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u064E\u0627\u0628\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0641\u064E\u0638\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u0639\u06E1\u0631\u064F\u062C\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0644\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0633\u064F\u0643\u0651\u0650\u0631\u064E\u062A\u06E1 \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F\u0646\u064E\u0627 \u0628\u064E\u0644\u06E1 \u0646\u064E\u062D\u06E1\u0646\u064F \u0642\u064E\u0648\u06E1\u0645\u065E \u0645\u0651\u064E\u0633\u06E1\u062D\u064F\u0648\u0631\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0628\u064F\u0631\u064F\u0648\u062C\u0657\u0627 \u0648\u064E\u0632\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0640\u0670\u0647\u064E\u0627 \u0644\u0650\u0644\u0646\u0651\u064E\u0640\u0670\u0638\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u0648\u064E\u062D\u064E\u0641\u0650\u0638\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0656 \u0631\u0651\u064E\u062C\u0650\u064A\u0645\u064D" }, { id: 18, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0631\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u064E \u0641\u064E\u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u064E\u0647\u064F\u06E5 \u0634\u0650\u0647\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 19, text: "\u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0645\u064E\u062F\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u064A\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0631\u064E\u0648\u064E\u0670\u0633\u0650\u064A\u064E \u0648\u064E\u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u064E\u0648\u06E1\u0632\u064F\u0648\u0646\u0656" }, { id: 20, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0639\u064E\u0670\u064A\u0650\u0634\u064E \u0648\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0633\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0631\u064E\u0670\u0632\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0625\u0650\u0646 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u0650\u0646\u062F\u064E\u0646\u064E\u0627 \u062E\u064E\u0632\u064E\u0627\u0653\u0626\u0650\u0646\u064F\u0647\u064F\u06E5 \u0648\u064E\u0645\u064E\u0627 \u0646\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0642\u064E\u062F\u064E\u0631\u0656 \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u0656" }, { id: 22, text: "\u0648\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0631\u0651\u0650\u064A\u064E\u0670\u062D\u064E \u0644\u064E\u0648\u064E\u0670\u0642\u0650\u062D\u064E \u0641\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u0633\u06E1\u0642\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u064F\u0648\u0647\u064F \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u062E\u064E\u0670\u0632\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 23, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0646\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u0646\u064F\u0645\u0650\u064A\u062A\u064F \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u06E1\u0648\u064E\u0670\u0631\u0650\u062B\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u06E1\u062F\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0647\u064F\u0648\u064E \u064A\u064E\u062D\u06E1\u0634\u064F\u0631\u064F\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u062D\u064E\u0643\u0650\u064A\u0645\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 26, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0645\u0650\u0646 \u0635\u064E\u0644\u06E1\u0635\u064E\u0670\u0644\u0656 \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u0645\u064E\u0625\u0656 \u0645\u0651\u064E\u0633\u06E1\u0646\u064F\u0648\u0646\u0656" }, { id: 27, text: "\u0648\u064E\u0671\u0644\u06E1\u062C\u064E\u0627\u0653\u0646\u0651\u064E \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0645\u0650\u0646 \u0646\u0651\u064E\u0627\u0631\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064F\u0648\u0645\u0650" }, { id: 28, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0644\u0650\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u062E\u064E\u0670\u0644\u0650\u0642\u064F\u06E2 \u0628\u064E\u0634\u064E\u0631\u0657\u0627 \u0645\u0651\u0650\u0646 \u0635\u064E\u0644\u06E1\u0635\u064E\u0670\u0644\u0656 \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u0645\u064E\u0625\u0656 \u0645\u0651\u064E\u0633\u06E1\u0646\u064F\u0648\u0646\u0656" }, { id: 29, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u0648\u0651\u064E\u064A\u06E1\u062A\u064F\u0647\u064F\u06E5 \u0648\u064E\u0646\u064E\u0641\u064E\u062E\u06E1\u062A\u064F \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646 \u0631\u0651\u064F\u0648\u062D\u0650\u064A \u0641\u064E\u0642\u064E\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0633\u064E\u0670\u062C\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0641\u064E\u0633\u064E\u062C\u064E\u062F\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0643\u064F\u0644\u0651\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064E \u0623\u064E\u0628\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0633\u0651\u064E\u0640\u0670\u062C\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0640\u0670\u0653\u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064F \u0645\u064E\u0627 \u0644\u064E\u0643\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0633\u0651\u064E\u0640\u0670\u062C\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0645\u06E1 \u0623\u064E\u0643\u064F\u0646 \u0644\u0651\u0650\u0623\u064E\u0633\u06E1\u062C\u064F\u062F\u064E \u0644\u0650\u0628\u064E\u0634\u064E\u0631\u064D \u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0635\u064E\u0644\u06E1\u0635\u064E\u0670\u0644\u0656 \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u0645\u064E\u0625\u0656 \u0645\u0651\u064E\u0633\u06E1\u0646\u064F\u0648\u0646\u0656" }, { id: 34, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0671\u062E\u06E1\u0631\u064F\u062C\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0631\u064E\u062C\u0650\u064A\u0645\u065E" }, { id: 35, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0639\u06E1\u0646\u064E\u0629\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 36, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0641\u064E\u0623\u064E\u0646\u0638\u0650\u0631\u06E1\u0646\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u064A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u0638\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0648\u064E\u0642\u06E1\u062A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u0650" }, { id: 39, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0648\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0644\u064E\u0623\u064F\u0632\u064E\u064A\u0651\u0650\u0646\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0623\u064F\u063A\u06E1\u0648\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 40, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u0643\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0644\u064E\u0635\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0635\u0650\u0631\u064E\u0670\u0637\u064C \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u064C" }, { id: 42, text: "\u0625\u0650\u0646\u0651\u064E \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0627\u0648\u0650\u064A\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0644\u064E\u0645\u064E\u0648\u06E1\u0639\u0650\u062F\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 44, text: "\u0644\u064E\u0647\u064E\u0627 \u0633\u064E\u0628\u06E1\u0639\u064E\u0629\u064F \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u0656 \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0628\u064E\u0627\u0628\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062C\u064F\u0632\u06E1\u0621\u065E \u0645\u0651\u064E\u0642\u06E1\u0633\u064F\u0648\u0645\u064C" }, { id: 45, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u0639\u064F\u064A\u064F\u0648\u0646\u064D" }, { id: 46, text: "\u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0647\u064E\u0627 \u0628\u0650\u0633\u064E\u0644\u064E\u0670\u0645\u064D \u0621\u064E\u0627\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0646\u064E\u0632\u064E\u0639\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u063A\u0650\u0644\u0651\u064D \u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u064B\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064F\u0631\u064F\u0631\u0656 \u0645\u0651\u064F\u062A\u064E\u0642\u064E\u0670\u0628\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0644\u064E\u0627 \u064A\u064E\u0645\u064E\u0633\u0651\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0646\u064E\u0635\u064E\u0628\u065E \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u0628\u0650\u0645\u064F\u062E\u06E1\u0631\u064E\u062C\u0650\u064A\u0646\u064E" }, { id: 49, text: "\u06DE\u0646\u064E\u0628\u0651\u0650\u0626\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A\u0653 \u0623\u064E\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0646\u064E\u0627 \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 50, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u0650\u064A \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0671\u0644\u06E1\u0623\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 51, text: "\u0648\u064E\u0646\u064E\u0628\u0651\u0650\u0626\u06E1\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0636\u064E\u064A\u06E1\u0641\u0650 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E" }, { id: 52, text: "\u0625\u0650\u0630\u06E1 \u062F\u064E\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0644\u064E\u0670\u0645\u0657\u0627 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u062C\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0648\u06E1\u062C\u064E\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064F\u0643\u064E \u0628\u0650\u063A\u064F\u0644\u064E\u0670\u0645\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 54, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0628\u064E\u0634\u0651\u064E\u0631\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u0650\u064A \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u0645\u0651\u064E\u0633\u0651\u064E\u0646\u0650\u064A\u064E \u0671\u0644\u06E1\u0643\u0650\u0628\u064E\u0631\u064F \u0641\u064E\u0628\u0650\u0645\u064E \u062A\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0634\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0670\u0646\u0650\u0637\u0650\u064A\u0646\u064E" }, { id: 56, text: "\u0642\u064E\u0627\u0644\u064E \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0642\u06E1\u0646\u064E\u0637\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0636\u0651\u064E\u0627\u0653\u0644\u0651\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0645\u064E\u0627 \u062E\u064E\u0637\u06E1\u0628\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0656 \u0645\u0651\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 59, text: "\u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u0644\u064E \u0644\u064F\u0648\u0637\u064D \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064F\u0646\u064E\u062C\u0651\u064F\u0648\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 60, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E\u0647\u064F\u06E5 \u0642\u064E\u062F\u0651\u064E\u0631\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 61, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0621\u064E\u0627\u0644\u064E \u0644\u064F\u0648\u0637\u064D \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0645\u0651\u064F\u0646\u0643\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u06E1 \u062C\u0650\u0626\u06E1\u0646\u064E\u0670\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u0645\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0648\u064E\u0623\u064E\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0635\u064E\u0670\u062F\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u0641\u064E\u0623\u064E\u0633\u06E1\u0631\u0650 \u0628\u0650\u0623\u064E\u0647\u06E1\u0644\u0650\u0643\u064E \u0628\u0650\u0642\u0650\u0637\u06E1\u0639\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0623\u064E\u062F\u06E1\u0628\u064E\u0670\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0644\u06E1\u062A\u064E\u0641\u0650\u062A\u06E1 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0623\u064E\u062D\u064E\u062F\u065E \u0648\u064E\u0671\u0645\u06E1\u0636\u064F\u0648\u0627\u0652 \u062D\u064E\u064A\u06E1\u062B\u064F \u062A\u064F\u0624\u06E1\u0645\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0648\u064E\u0642\u064E\u0636\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u062F\u064E\u0627\u0628\u0650\u0631\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0642\u06E1\u0637\u064F\u0648\u0639\u065E \u0645\u0651\u064F\u0635\u06E1\u0628\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 67, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0647\u06E1\u0644\u064F \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u064A\u064E\u0633\u06E1\u062A\u064E\u0628\u06E1\u0634\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0636\u064E\u064A\u06E1\u0641\u0650\u064A \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0641\u06E1\u0636\u064E\u062D\u064F\u0648\u0646\u0650" }, { id: 69, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062E\u06E1\u0632\u064F\u0648\u0646\u0650" }, { id: 70, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u0646\u06E1\u0647\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 71, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0628\u064E\u0646\u064E\u0627\u062A\u0650\u064A\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u064E\u0670\u0639\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 72, text: "\u0644\u064E\u0639\u064E\u0645\u06E1\u0631\u064F\u0643\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0641\u0650\u064A \u0633\u064E\u0643\u06E1\u0631\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0645\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u062D\u064E\u0629\u064F \u0645\u064F\u0634\u06E1\u0631\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 74, text: "\u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0670\u0644\u0650\u064A\u064E\u0647\u064E\u0627 \u0633\u064E\u0627\u0641\u0650\u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0645\u06E1\u0637\u064E\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062D\u0650\u062C\u064E\u0627\u0631\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0633\u0650\u062C\u0651\u0650\u064A\u0644\u064D" }, { id: 75, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062A\u064E\u0648\u064E\u0633\u0651\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 76, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0644\u064E\u0628\u0650\u0633\u064E\u0628\u0650\u064A\u0644\u0656 \u0645\u0651\u064F\u0642\u0650\u064A\u0645\u064D" }, { id: 77, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 78, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u0623\u064E\u064A\u06E1\u0643\u064E\u0629\u0650 \u0644\u064E\u0638\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 79, text: "\u0641\u064E\u0671\u0646\u062A\u064E\u0642\u064E\u0645\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u064E\u0627 \u0644\u064E\u0628\u0650\u0625\u0650\u0645\u064E\u0627\u0645\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 80, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062D\u0650\u062C\u06E1\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 81, text: "\u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0645\u064F\u0639\u06E1\u0631\u0650\u0636\u0650\u064A\u0646\u064E" }, { id: 82, text: "\u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0646\u06E1\u062D\u0650\u062A\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u0650 \u0628\u064F\u064A\u064F\u0648\u062A\u064B\u0627 \u0621\u064E\u0627\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 83, text: "\u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u062D\u064E\u0629\u064F \u0645\u064F\u0635\u06E1\u0628\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 84, text: "\u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 85, text: "\u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0644\u064E\u0623\u0653\u062A\u0650\u064A\u064E\u0629\u065E\u06D6 \u0641\u064E\u0671\u0635\u06E1\u0641\u064E\u062D\u0650 \u0671\u0644\u0635\u0651\u064E\u0641\u06E1\u062D\u064E \u0671\u0644\u06E1\u062C\u064E\u0645\u0650\u064A\u0644\u064E" }, { id: 86, text: "\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062E\u064E\u0644\u0651\u064E\u0640\u0670\u0642\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 87, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064E \u0633\u064E\u0628\u06E1\u0639\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u062B\u064E\u0627\u0646\u0650\u064A \u0648\u064E\u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064E" }, { id: 88, text: "\u0644\u064E\u0627 \u062A\u064E\u0645\u064F\u062F\u0651\u064E\u0646\u0651\u064E \u0639\u064E\u064A\u06E1\u0646\u064E\u064A\u06E1\u0643\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0645\u064E\u062A\u0651\u064E\u0639\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0671\u062E\u06E1\u0641\u0650\u0636\u06E1 \u062C\u064E\u0646\u064E\u0627\u062D\u064E\u0643\u064E \u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 89, text: "\u0648\u064E\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0646\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0630\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 90, text: "\u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0642\u06E1\u062A\u064E\u0633\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 91, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0639\u0650\u0636\u0650\u064A\u0646\u064E" }, { id: 92, text: "\u0641\u064E\u0648\u064E\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0646\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 93, text: "\u0639\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 94, text: "\u0641\u064E\u0671\u0635\u06E1\u062F\u064E\u0639\u06E1 \u0628\u0650\u0645\u064E\u0627 \u062A\u064F\u0624\u06E1\u0645\u064E\u0631\u064F \u0648\u064E\u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 95, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064E\u0641\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u0650\u064A\u0646\u064E" }, { id: 96, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u064E\u06DA \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0623\u064E\u0646\u0651\u064E\u0643\u064E \u064A\u064E\u0636\u0650\u064A\u0642\u064F \u0635\u064E\u062F\u06E1\u0631\u064F\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E" }, { id: 98, text: "\u0641\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0648\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0640\u0670\u062C\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 99, text: "\u0648\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u06E1 \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0643\u064E \u0671\u0644\u06E1\u064A\u064E\u0642\u0650\u064A\u0646\u064F" }] }, { id: 16, name: "\u0627\u0644\u0646\u062D\u0644", transliteration: "An-Nahl", type: "meccan", total_verses: 128, verses: [{ id: 1, text: "\u0623\u064E\u062A\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0647\u064F\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649\u0670 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 2, text: "\u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064E \u0628\u0650\u0671\u0644\u0631\u0651\u064F\u0648\u062D\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0646\u0630\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u0650" }, { id: 3, text: "\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649\u0670 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0645\u0650\u0646 \u0646\u0651\u064F\u0637\u06E1\u0641\u064E\u0629\u0656 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0648\u064E \u062E\u064E\u0635\u0650\u064A\u0645\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 5, text: "\u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u064E \u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064E\u0627\u06D6 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062F\u0650\u0641\u06E1\u0621\u065E \u0648\u064E\u0645\u064E\u0646\u064E\u0670\u0641\u0650\u0639\u064F \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062C\u064E\u0645\u064E\u0627\u0644\u064C \u062D\u0650\u064A\u0646\u064E \u062A\u064F\u0631\u0650\u064A\u062D\u064F\u0648\u0646\u064E \u0648\u064E\u062D\u0650\u064A\u0646\u064E \u062A\u064E\u0633\u06E1\u0631\u064E\u062D\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u062A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F \u0623\u064E\u062B\u06E1\u0642\u064E\u0627\u0644\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0644\u064E\u062F\u0656 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0628\u064E\u0670\u0644\u0650\u063A\u0650\u064A\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0634\u0650\u0642\u0651\u0650 \u0671\u0644\u06E1\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0631\u064E\u0621\u064F\u0648\u0641\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 8, text: "\u0648\u064E\u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u06E1\u0628\u0650\u063A\u064E\u0627\u0644\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u0631\u064E \u0644\u0650\u062A\u064E\u0631\u06E1\u0643\u064E\u0628\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u0632\u0650\u064A\u0646\u064E\u0629\u0657\u06DA \u0648\u064E\u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0642\u064E\u0635\u06E1\u062F\u064F \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062C\u064E\u0627\u0653\u0626\u0650\u0631\u065E\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0644\u064E\u0647\u064E\u062F\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 10, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657\u06D6 \u0644\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0634\u064E\u0631\u064E\u0627\u0628\u065E \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F \u0634\u064E\u062C\u064E\u0631\u065E \u0641\u0650\u064A\u0647\u0650 \u062A\u064F\u0633\u0650\u064A\u0645\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u064A\u064F\u0646\u06E2\u0628\u0650\u062A\u064F \u0644\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u0650 \u0671\u0644\u0632\u0651\u064E\u0631\u06E1\u0639\u064E \u0648\u064E\u0671\u0644\u0632\u0651\u064E\u064A\u06E1\u062A\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u062E\u0650\u064A\u0644\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0646\u064E\u0670\u0628\u064E \u0648\u064E\u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E\u06D6 \u0648\u064E\u0671\u0644\u0646\u0651\u064F\u062C\u064F\u0648\u0645\u064F \u0645\u064F\u0633\u064E\u062E\u0651\u064E\u0631\u064E\u0670\u062A\u064F\u06E2 \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0648\u064E\u0645\u064E\u0627 \u0630\u064E\u0631\u064E\u0623\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064F\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064B\u0627 \u0623\u064E\u0644\u06E1\u0648\u064E\u0670\u0646\u064F\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E \u0644\u0650\u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F \u0644\u064E\u062D\u06E1\u0645\u0657\u0627 \u0637\u064E\u0631\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u062A\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F \u062D\u0650\u0644\u06E1\u064A\u064E\u0629\u0657 \u062A\u064E\u0644\u06E1\u0628\u064E\u0633\u064F\u0648\u0646\u064E\u0647\u064E\u0627\u06D6 \u0648\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064E \u0645\u064E\u0648\u064E\u0627\u062E\u0650\u0631\u064E \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0644\u0650\u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0631\u064E\u0648\u064E\u0670\u0633\u0650\u064A\u064E \u0623\u064E\u0646 \u062A\u064E\u0645\u0650\u064A\u062F\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u0657\u0627 \u0648\u064E\u0633\u064F\u0628\u064F\u0644\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0648\u064E\u0639\u064E\u0644\u064E\u0670\u0645\u064E\u0670\u062A\u0656\u06DA \u0648\u064E\u0628\u0650\u0671\u0644\u0646\u0651\u064E\u062C\u06E1\u0645\u0650 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0643\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0627 \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0639\u064F\u062F\u0651\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u062A\u064F\u062D\u06E1\u0635\u064F\u0648\u0647\u064E\u0627\u0653\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 19, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064F\u0633\u0650\u0631\u0651\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0639\u06E1\u0644\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F\u0648\u0646\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u062E\u06E1\u0644\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u062A\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0623\u064E\u062D\u06E1\u064A\u064E\u0627\u0653\u0621\u0656\u06D6 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E \u0623\u064E\u064A\u0651\u064E\u0627\u0646\u064E \u064A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0625\u0650\u0644\u064E\u0670\u0647\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E\u06DA \u0641\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0646\u0643\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0644\u064E\u0627 \u062C\u064E\u0631\u064E\u0645\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u064A\u064F\u0633\u0650\u0631\u0651\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0639\u06E1\u0644\u0650\u0646\u064F\u0648\u0646\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 24, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627\u0630\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0633\u064E\u0670\u0637\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 25, text: "\u0644\u0650\u064A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1\u0632\u064E\u0627\u0631\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0645\u0650\u0644\u064E\u0629\u0657 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0648\u064E\u0645\u0650\u0646\u06E1 \u0623\u064E\u0648\u06E1\u0632\u064E\u0627\u0631\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0648\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u064D\u06D7 \u0623\u064E\u0644\u064E\u0627 \u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u064A\u064E\u0632\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0642\u064E\u062F\u06E1 \u0645\u064E\u0643\u064E\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u064E\u062A\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064F\u0646\u06E1\u064A\u064E\u0670\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u064E\u0627\u0639\u0650\u062F\u0650 \u0641\u064E\u062E\u064E\u0631\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0642\u06E1\u0641\u064F \u0645\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u064A\u064F\u062E\u06E1\u0632\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0623\u064E\u064A\u06E1\u0646\u064E \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0634\u064E\u0640\u0670\u0653\u0642\u0651\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u0650\u0645\u06E1\u06DA \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064E \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u062E\u0650\u0632\u06E1\u064A\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0648\u064E\u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0638\u064E\u0627\u0644\u0650\u0645\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0645\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u0639\u06E1\u0645\u064E\u0644\u064F \u0645\u0650\u0646 \u0633\u064F\u0648\u0653\u0621\u0650\u06ED\u06DA \u0628\u064E\u0644\u064E\u0649\u0670\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0641\u064E\u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0641\u064E\u0644\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u062B\u06E1\u0648\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0643\u064E\u0628\u0651\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u06DE\u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0645\u064E\u0627\u0630\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627\u06D7 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u065E\u06DA \u0648\u064E\u0644\u064E\u062F\u064E\u0627\u0631\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E\u06DA \u0648\u064E\u0644\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u062F\u064E\u0627\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 31, text: "\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u064F \u0639\u064E\u062F\u06E1\u0646\u0656 \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06D6 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u0648\u0646\u064E\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0637\u064E\u064A\u0651\u0650\u0628\u0650\u064A\u0646\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0647\u064E\u0644\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0623\u064E\u0648\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0623\u064E\u0645\u06E1\u0631\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0641\u064E\u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u064F \u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u062D\u064E\u0627\u0642\u064E \u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u0639\u064E\u0628\u064E\u062F\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0646\u0651\u064E\u062D\u06E1\u0646\u064F \u0648\u064E\u0644\u064E\u0627\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0641\u064E\u0647\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 36, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0628\u064E\u0639\u064E\u062B\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064B\u0627 \u0623\u064E\u0646\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u062C\u06E1\u062A\u064E\u0646\u0650\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u0637\u0651\u064E\u0640\u0670\u063A\u064F\u0648\u062A\u064E\u06D6 \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0647\u064E\u062F\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u062D\u064E\u0642\u0651\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u0636\u0651\u064E\u0644\u064E\u0670\u0644\u064E\u0629\u064F\u06DA \u0641\u064E\u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 37, text: "\u0625\u0650\u0646 \u062A\u064E\u062D\u06E1\u0631\u0650\u0635\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0647\u064F\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064F\u0636\u0650\u0644\u0651\u064F\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0640\u0670\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u0648\u064E\u0623\u064E\u0642\u06E1\u0633\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0647\u06E1\u062F\u064E \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0646 \u064A\u064E\u0645\u064F\u0648\u062A\u064F\u06DA \u0628\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0639\u06E1\u062F\u064B\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062D\u064E\u0642\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0644\u0650\u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0644\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 40, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0642\u064E\u0648\u06E1\u0644\u064F\u0646\u064E\u0627 \u0644\u0650\u0634\u064E\u064A\u06E1\u0621\u064D \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064F \u0623\u064E\u0646 \u0646\u0651\u064E\u0642\u064F\u0648\u0644\u064E \u0644\u064E\u0647\u064F\u06E5 \u0643\u064F\u0646 \u0641\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F" }, { id: 41, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062C\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u0638\u064F\u0644\u0650\u0645\u064F\u0648\u0627\u0652 \u0644\u064E\u0646\u064F\u0628\u064E\u0648\u0651\u0650\u0626\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0657\u06D6 \u0648\u064E\u0644\u064E\u0623\u064E\u062C\u06E1\u0631\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u06DA \u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u0650\u062C\u064E\u0627\u0644\u0657\u0627 \u0646\u0651\u064F\u0648\u062D\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0632\u0651\u064F\u0628\u064F\u0631\u0650\u06D7 \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E \u0644\u0650\u062A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0627 \u0646\u064F\u0632\u0651\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0623\u064E\u0641\u064E\u0623\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u064E\u0643\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u0623\u064E\u0646 \u064A\u064E\u062E\u06E1\u0633\u0650\u0641\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0623\u064E\u0648\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u0623\u064E\u0648\u06E1 \u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u062A\u064E\u0642\u064E\u0644\u0651\u064F\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0628\u0650\u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0623\u064E\u0648\u06E1 \u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u062A\u064E\u062E\u064E\u0648\u0651\u064F\u0641\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0631\u064E\u0621\u064F\u0648\u0641\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 48, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u064A\u064E\u062A\u064E\u0641\u064E\u064A\u0651\u064E\u0624\u064F\u0627\u0652 \u0638\u0650\u0644\u064E\u0670\u0644\u064F\u0647\u064F\u06E5 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0645\u064E\u0627\u0653\u0626\u0650\u0644\u0650 \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u062F\u064E\u0670\u062E\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06E4 \u064A\u064E\u0633\u06E1\u062C\u064F\u062F\u064F\u06E4 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u0650\u0646 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0656 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u064E\u0631\u064F\u0648\u0646\u064E\u06E9" }, { id: 51, text: "\u06DE\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0670\u0647\u064E\u064A\u06E1\u0646\u0650 \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E \u0641\u064E\u0625\u0650\u064A\u0651\u064E\u0640\u0670\u064A\u064E \u0641\u064E\u0671\u0631\u06E1\u0647\u064E\u0628\u064F\u0648\u0646\u0650" }, { id: 52, text: "\u0648\u064E\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064F \u0648\u064E\u0627\u0635\u0650\u0628\u064B\u0627\u06DA \u0623\u064E\u0641\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0648\u064E\u0645\u064E\u0627 \u0628\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u0650\u0639\u06E1\u0645\u064E\u0629\u0656 \u0641\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0636\u0651\u064F\u0631\u0651\u064F \u0641\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064E\u062C\u06E1\u0640\u0654\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0630\u064E\u0627 \u0643\u064E\u0634\u064E\u0641\u064E \u0671\u0644\u0636\u0651\u064F\u0631\u0651\u064E \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u0643\u064F\u0645 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0644\u0650\u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1\u06DA \u0641\u064E\u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0627\u0652 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E \u0644\u0650\u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0646\u064E\u0635\u0650\u064A\u0628\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1\u06D7 \u062A\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u062A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0646\u0651\u064E \u0639\u064E\u0645\u0651\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0628\u064E\u0646\u064E\u0670\u062A\u0650 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u0634\u06E1\u062A\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0628\u064F\u0634\u0651\u0650\u0631\u064E \u0623\u064E\u062D\u064E\u062F\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u0649\u0670 \u0638\u064E\u0644\u0651\u064E \u0648\u064E\u062C\u06E1\u0647\u064F\u0647\u064F\u06E5 \u0645\u064F\u0633\u06E1\u0648\u064E\u062F\u0651\u0657\u0627 \u0648\u064E\u0647\u064F\u0648\u064E \u0643\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 59, text: "\u064A\u064E\u062A\u064E\u0648\u064E\u0670\u0631\u064E\u0649\u0670 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0645\u0650\u0646 \u0633\u064F\u0648\u0653\u0621\u0650 \u0645\u064E\u0627 \u0628\u064F\u0634\u0651\u0650\u0631\u064E \u0628\u0650\u0647\u0650\u06E6\u0653\u06DA \u0623\u064E\u064A\u064F\u0645\u06E1\u0633\u0650\u0643\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0647\u064F\u0648\u0646\u064D \u0623\u064E\u0645\u06E1 \u064A\u064E\u062F\u064F\u0633\u0651\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u062A\u0651\u064F\u0631\u064E\u0627\u0628\u0650\u06D7 \u0623\u064E\u0644\u064E\u0627 \u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u0633\u0651\u064E\u0648\u06E1\u0621\u0650\u06D6 \u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0649\u0670\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 61, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u064A\u064F\u0624\u064E\u0627\u062E\u0650\u0630\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0628\u0650\u0638\u064F\u0644\u06E1\u0645\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0645\u0650\u0646 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u064A\u064F\u0624\u064E\u062E\u0651\u0650\u0631\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u062C\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u062E\u0650\u0631\u064F\u0648\u0646\u064E \u0633\u064E\u0627\u0639\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0642\u06E1\u062F\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u064A\u064E\u0643\u06E1\u0631\u064E\u0647\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u062A\u064E\u0635\u0650\u0641\u064F \u0623\u064E\u0644\u06E1\u0633\u0650\u0646\u064E\u062A\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670\u06DA \u0644\u064E\u0627 \u062C\u064E\u0631\u064E\u0645\u064E \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E \u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0641\u06E1\u0631\u064E\u0637\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u062A\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u064E\u0645\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0641\u064E\u0632\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0648\u064E \u0648\u064E\u0644\u0650\u064A\u0651\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 64, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u062A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u062D\u06E1\u064A\u064E\u0627 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0644\u064E\u0639\u0650\u0628\u06E1\u0631\u064E\u0629\u0657\u06D6 \u0646\u0651\u064F\u0633\u06E1\u0642\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0641\u0650\u064A \u0628\u064F\u0637\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u0631\u06E1\u062B\u0656 \u0648\u064E\u062F\u064E\u0645\u0656 \u0644\u0651\u064E\u0628\u064E\u0646\u064B\u0627 \u062E\u064E\u0627\u0644\u0650\u0635\u0657\u0627 \u0633\u064E\u0627\u0653\u0626\u0650\u063A\u0657\u0627 \u0644\u0651\u0650\u0644\u0634\u0651\u064E\u0640\u0670\u0631\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 67, text: "\u0648\u064E\u0645\u0650\u0646 \u062B\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u062E\u0650\u064A\u0644\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0646\u064E\u0670\u0628\u0650 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0633\u064E\u0643\u064E\u0631\u0657\u0627 \u0648\u064E\u0631\u0650\u0632\u06E1\u0642\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0648\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u062D\u06E1\u0644\u0650 \u0623\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u062E\u0650\u0630\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u0650 \u0628\u064F\u064A\u064F\u0648\u062A\u0657\u0627 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u0650 \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0631\u0650\u0634\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u062B\u064F\u0645\u0651\u064E \u0643\u064F\u0644\u0650\u064A \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u0641\u064E\u0671\u0633\u06E1\u0644\u064F\u0643\u0650\u064A \u0633\u064F\u0628\u064F\u0644\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u0650 \u0630\u064F\u0644\u064F\u0644\u0657\u0627\u06DA \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646\u06E2 \u0628\u064F\u0637\u064F\u0648\u0646\u0650\u0647\u064E\u0627 \u0634\u064E\u0631\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064C \u0623\u064E\u0644\u06E1\u0648\u064E\u0670\u0646\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A\u0647\u0650 \u0634\u0650\u0641\u064E\u0627\u0653\u0621\u065E \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064F\u0631\u064E\u062F\u0651\u064F \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0631\u06E1\u0630\u064E\u0644\u0650 \u0671\u0644\u06E1\u0639\u064F\u0645\u064F\u0631\u0650 \u0644\u0650\u0643\u064E\u064A\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0639\u0650\u0644\u06E1\u0645\u0656 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u065E \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 71, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0636\u0651\u064E\u0644\u064E \u0628\u064E\u0639\u06E1\u0636\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u0641\u0650\u064A \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u0650\u06DA \u0641\u064E\u0645\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u064F\u0636\u0651\u0650\u0644\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u064E\u0627\u0653\u062F\u0651\u0650\u064A \u0631\u0650\u0632\u06E1\u0642\u0650\u0647\u0650\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064C\u06DA \u0623\u064E\u0641\u064E\u0628\u0650\u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u062C\u06E1\u062D\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0643\u064F\u0645 \u0628\u064E\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u062D\u064E\u0641\u064E\u062F\u064E\u0629\u0657 \u0648\u064E\u0631\u064E\u0632\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650\u06DA \u0623\u064E\u0641\u064E\u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0648\u064E\u0628\u0650\u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0648\u064E\u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0631\u0650\u0632\u06E1\u0642\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E" }, { id: 74, text: "\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0636\u06E1\u0631\u0650\u0628\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u062B\u064E\u0627\u0644\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 75, text: "\u06DE\u0636\u064E\u0631\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u062B\u064E\u0644\u064B\u0627 \u0639\u064E\u0628\u06E1\u062F\u0657\u0627 \u0645\u0651\u064E\u0645\u06E1\u0644\u064F\u0648\u0643\u0657\u0627 \u0644\u0651\u064E\u0627 \u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0645\u064E\u0646 \u0631\u0651\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646\u0651\u064E\u0627 \u0631\u0650\u0632\u06E1\u0642\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627 \u0641\u064E\u0647\u064F\u0648\u064E \u064A\u064F\u0646\u0641\u0650\u0642\u064F \u0645\u0650\u0646\u06E1\u0647\u064F \u0633\u0650\u0631\u0651\u0657\u0627 \u0648\u064E\u062C\u064E\u0647\u06E1\u0631\u064B\u0627\u06D6 \u0647\u064E\u0644\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u064F\u06E5\u0646\u064E\u06DA \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0648\u064E\u0636\u064E\u0631\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0631\u0651\u064E\u062C\u064F\u0644\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u062D\u064E\u062F\u064F\u0647\u064F\u0645\u064E\u0627\u0653 \u0623\u064E\u0628\u06E1\u0643\u064E\u0645\u064F \u0644\u064E\u0627 \u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0647\u064F\u0648\u064E \u0643\u064E\u0644\u0651\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0647\u064F \u0623\u064E\u064A\u06E1\u0646\u064E\u0645\u064E\u0627 \u064A\u064F\u0648\u064E\u062C\u0651\u0650\u0647\u0647\u0651\u064F \u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u062E\u064E\u064A\u06E1\u0631\u064D \u0647\u064E\u0644\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0647\u064F\u0648\u064E \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u062F\u06E1\u0644\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 77, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u063A\u064E\u064A\u06E1\u0628\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0631\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0644\u064E\u0645\u06E1\u062D\u0650 \u0671\u0644\u06E1\u0628\u064E\u0635\u064E\u0631\u0650 \u0623\u064E\u0648\u06E1 \u0647\u064F\u0648\u064E \u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 78, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064F\u0637\u064F\u0648\u0646\u0650 \u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u0629\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 79, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u0650 \u0645\u064F\u0633\u064E\u062E\u0651\u064E\u0631\u064E\u0670\u062A\u0656 \u0641\u0650\u064A \u062C\u064E\u0648\u0651\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627 \u064A\u064F\u0645\u06E1\u0633\u0650\u0643\u064F\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 80, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064F\u064A\u064F\u0648\u062A\u0650\u0643\u064F\u0645\u06E1 \u0633\u064E\u0643\u064E\u0646\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062C\u064F\u0644\u064F\u0648\u062F\u0650 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0628\u064F\u064A\u064F\u0648\u062A\u0657\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u062E\u0650\u0641\u0651\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064E \u0638\u064E\u0639\u06E1\u0646\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0625\u0650\u0642\u064E\u0627\u0645\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u0650\u0646\u06E1 \u0623\u064E\u0635\u06E1\u0648\u064E\u0627\u0641\u0650\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0648\u06E1\u0628\u064E\u0627\u0631\u0650\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0634\u06E1\u0639\u064E\u0627\u0631\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u062B\u064E\u0670\u062B\u0657\u0627 \u0648\u064E\u0645\u064E\u062A\u064E\u0670\u0639\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 81, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0638\u0650\u0644\u064E\u0670\u0644\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u0650 \u0623\u064E\u0643\u06E1\u0646\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0633\u064E\u0631\u064E\u0670\u0628\u0650\u064A\u0644\u064E \u062A\u064E\u0642\u0650\u064A\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0631\u0651\u064E \u0648\u064E\u0633\u064E\u0631\u064E\u0670\u0628\u0650\u064A\u0644\u064E \u062A\u064E\u0642\u0650\u064A\u0643\u064F\u0645 \u0628\u064E\u0623\u06E1\u0633\u064E\u0643\u064F\u0645\u06E1\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u062A\u0650\u0645\u0651\u064F \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 82, text: "\u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 83, text: "\u064A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0646\u0643\u0650\u0631\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 84, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u0628\u06E1\u0639\u064E\u062B\u064F \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0630\u064E\u0646\u064F \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0633\u06E1\u062A\u064E\u0639\u06E1\u062A\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 85, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0621\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u062E\u064E\u0641\u0651\u064E\u0641\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0638\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 86, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0621\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0627\u0652 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0643\u064E\u06D6 \u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 87, text: "\u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0645\u064E\u06D6 \u0648\u064E\u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 88, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0635\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0632\u0650\u062F\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0641\u064E\u0648\u06E1\u0642\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 89, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u0628\u06E1\u0639\u064E\u062B\u064F \u0641\u0650\u064A \u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u064B\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u062C\u0650\u0626\u06E1\u0646\u064E\u0627 \u0628\u0650\u0643\u064E \u0634\u064E\u0647\u0650\u064A\u062F\u064B\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650\u06DA \u0648\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u062A\u0650\u0628\u06E1\u064A\u064E\u0670\u0646\u0657\u0627 \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0648\u064E\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 90, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u062F\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u0650 \u0648\u064E\u0625\u0650\u064A\u062A\u064E\u0627\u0653\u064A\u0655\u0650 \u0630\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0648\u064E\u064A\u064E\u0646\u06E1\u0647\u064E\u0649\u0670 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0641\u064E\u062D\u06E1\u0634\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u063A\u06E1\u064A\u0650\u06DA \u064A\u064E\u0639\u0650\u0638\u064F\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 91, text: "\u0648\u064E\u0623\u064E\u0648\u06E1\u0641\u064F\u0648\u0627\u0652 \u0628\u0650\u0639\u064E\u0647\u06E1\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0630\u064E\u0627 \u0639\u064E\u0670\u0647\u064E\u062F\u062A\u0651\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u0642\u064F\u0636\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u062A\u064E\u0648\u06E1\u0643\u0650\u064A\u062F\u0650\u0647\u064E\u0627 \u0648\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0639\u064E\u0644\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0643\u064E\u0641\u0650\u064A\u0644\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 92, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0646\u064E\u0642\u064E\u0636\u064E\u062A\u06E1 \u063A\u064E\u0632\u06E1\u0644\u064E\u0647\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0642\u064F\u0648\u0651\u064E\u0629\u064D \u0623\u064E\u0646\u0643\u064E\u0670\u062B\u0657\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0646\u064E \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u0643\u064F\u0645\u06E1 \u062F\u064E\u062E\u064E\u0644\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0623\u064F\u0645\u0651\u064E\u0629\u064C \u0647\u0650\u064A\u064E \u0623\u064E\u0631\u06E1\u0628\u064E\u0649\u0670 \u0645\u0650\u0646\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u064D\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0628\u06E1\u0644\u064F\u0648\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0644\u064E\u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0646\u0651\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u062A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 93, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u064A\u064F\u0636\u0650\u0644\u0651\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0644\u064E\u062A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0646\u0651\u064E \u0639\u064E\u0645\u0651\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 94, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u0643\u064F\u0645\u06E1 \u062F\u064E\u062E\u064E\u0644\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u062A\u064E\u0632\u0650\u0644\u0651\u064E \u0642\u064E\u062F\u064E\u0645\u064F\u06E2 \u0628\u064E\u0639\u06E1\u062F\u064E \u062B\u064F\u0628\u064F\u0648\u062A\u0650\u0647\u064E\u0627 \u0648\u064E\u062A\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u064E \u0628\u0650\u0645\u064E\u0627 \u0635\u064E\u062F\u064E\u062F\u062A\u0651\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 95, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0634\u06E1\u062A\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0639\u064E\u0647\u06E1\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064E\u0645\u064E\u0646\u0657\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 96, text: "\u0645\u064E\u0627 \u0639\u0650\u0646\u062F\u064E\u0643\u064F\u0645\u06E1 \u064A\u064E\u0646\u0641\u064E\u062F\u064F \u0648\u064E\u0645\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u064E\u0627\u0642\u0656\u06D7 \u0648\u064E\u0644\u064E\u0646\u064E\u062C\u06E1\u0632\u0650\u064A\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062C\u06E1\u0631\u064E\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u0650 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u0645\u064E\u0646\u06E1 \u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0645\u0651\u0650\u0646 \u0630\u064E\u0643\u064E\u0631\u064D \u0623\u064E\u0648\u06E1 \u0623\u064F\u0646\u062B\u064E\u0649\u0670 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u065E \u0641\u064E\u0644\u064E\u0646\u064F\u062D\u06E1\u064A\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0657 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0629\u0657\u06D6 \u0648\u064E\u0644\u064E\u0646\u064E\u062C\u06E1\u0632\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064E\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u0650 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 98, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0631\u064E\u0623\u06E1\u062A\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0639\u0650\u0630\u06E1 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u062C\u0650\u064A\u0645\u0650" }, { id: 99, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064F\u06E5 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u064C \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 100, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 101, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u062F\u0651\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u064E \u0621\u064E\u0627\u064A\u064E\u0629\u0656 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0645\u064F\u0641\u06E1\u062A\u064E\u0631\u0650\u06ED\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 102, text: "\u0642\u064F\u0644\u06E1 \u0646\u064E\u0632\u0651\u064E\u0644\u064E\u0647\u064F\u06E5 \u0631\u064F\u0648\u062D\u064F \u0671\u0644\u06E1\u0642\u064F\u062F\u064F\u0633\u0650 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u0650\u064A\u064F\u062B\u064E\u0628\u0651\u0650\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 103, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0647\u064F\u06E5 \u0628\u064E\u0634\u064E\u0631\u065E\u06D7 \u0644\u0651\u0650\u0633\u064E\u0627\u0646\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0644\u06E1\u062D\u0650\u062F\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0639\u06E1\u062C\u064E\u0645\u0650\u064A\u0651\u065E \u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u0650\u0633\u064E\u0627\u0646\u064C \u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 104, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 105, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u0650\u064A \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 106, text: "\u0645\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0623\u064F\u0643\u06E1\u0631\u0650\u0647\u064E \u0648\u064E\u0642\u064E\u0644\u06E1\u0628\u064F\u0647\u064F\u06E5 \u0645\u064F\u0637\u06E1\u0645\u064E\u0626\u0650\u0646\u0651\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0645\u0651\u064E\u0646 \u0634\u064E\u0631\u064E\u062D\u064E \u0628\u0650\u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u0650 \u0635\u064E\u062F\u06E1\u0631\u0657\u0627 \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u063A\u064E\u0636\u064E\u0628\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 107, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u0633\u06E1\u062A\u064E\u062D\u064E\u0628\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 108, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0637\u064E\u0628\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0633\u064E\u0645\u06E1\u0639\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0641\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 109, text: "\u0644\u064E\u0627 \u062C\u064E\u0631\u064E\u0645\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 110, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062C\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u0641\u064F\u062A\u0650\u0646\u064F\u0648\u0627\u0652 \u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0648\u064E\u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u064E\u0627 \u0644\u064E\u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 111, text: "\u06DE\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0623\u06E1\u062A\u0650\u064A \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u062A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0650\u0647\u064E\u0627 \u0648\u064E\u062A\u064F\u0648\u064E\u0641\u0651\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0645\u0651\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064E\u062A\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 112, text: "\u0648\u064E\u0636\u064E\u0631\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0657 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0621\u064E\u0627\u0645\u0650\u0646\u064E\u0629\u0657 \u0645\u0651\u064F\u0637\u06E1\u0645\u064E\u0626\u0650\u0646\u0651\u064E\u0629\u0657 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u064E\u0627 \u0631\u0650\u0632\u06E1\u0642\u064F\u0647\u064E\u0627 \u0631\u064E\u063A\u064E\u062F\u0657\u0627 \u0645\u0651\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u0643\u064E\u0627\u0646\u0656 \u0641\u064E\u0643\u064E\u0641\u064E\u0631\u064E\u062A\u06E1 \u0628\u0650\u0623\u064E\u0646\u06E1\u0639\u064F\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0623\u064E\u0630\u064E\u0670\u0642\u064E\u0647\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u0628\u064E\u0627\u0633\u064E \u0671\u0644\u06E1\u062C\u064F\u0648\u0639\u0650 \u0648\u064E\u0671\u0644\u06E1\u062E\u064E\u0648\u06E1\u0641\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0635\u06E1\u0646\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 113, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u0638\u064E\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 114, text: "\u0641\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062D\u064E\u0644\u064E\u0670\u0644\u0657\u0627 \u0637\u064E\u064A\u0651\u0650\u0628\u0657\u0627 \u0648\u064E\u0671\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u064A\u0651\u064E\u0627\u0647\u064F \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 115, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u062A\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u062F\u0651\u064E\u0645\u064E \u0648\u064E\u0644\u064E\u062D\u06E1\u0645\u064E \u0671\u0644\u06E1\u062E\u0650\u0646\u0632\u0650\u064A\u0631\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0647\u0650\u0644\u0651\u064E \u0644\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0636\u06E1\u0637\u064F\u0631\u0651\u064E \u063A\u064E\u064A\u06E1\u0631\u064E \u0628\u064E\u0627\u063A\u0656 \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0627\u062F\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 116, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0645\u064E\u0627 \u062A\u064E\u0635\u0650\u0641\u064F \u0623\u064E\u0644\u06E1\u0633\u0650\u0646\u064E\u062A\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u062D\u064E\u0644\u064E\u0670\u0644\u065E \u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u062D\u064E\u0631\u064E\u0627\u0645\u065E \u0644\u0651\u0650\u062A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E \u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 117, text: "\u0645\u064E\u062A\u064E\u0670\u0639\u065E \u0642\u064E\u0644\u0650\u064A\u0644\u065E \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 118, text: "\u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u062D\u064E\u0631\u0651\u064E\u0645\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0642\u064E\u0635\u064E\u0635\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 119, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u064E \u0628\u0650\u062C\u064E\u0647\u064E\u0670\u0644\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u064E\u0627 \u0644\u064E\u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 120, text: "\u0625\u0650\u0646\u0651\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0643\u064E\u0627\u0646\u064E \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0642\u064E\u0627\u0646\u0650\u062A\u0657\u0627 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0646\u0650\u064A\u0641\u0657\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 121, text: "\u0634\u064E\u0627\u0643\u0650\u0631\u0657\u0627 \u0644\u0651\u0650\u0623\u064E\u0646\u06E1\u0639\u064F\u0645\u0650\u0647\u0650\u06DA \u0671\u062C\u06E1\u062A\u064E\u0628\u064E\u0649\u0670\u0647\u064F \u0648\u064E\u0647\u064E\u062F\u064E\u0649\u0670\u0647\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 122, text: "\u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0657\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 123, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0623\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0645\u0650\u0644\u0651\u064E\u0629\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u062D\u064E\u0646\u0650\u064A\u0641\u0657\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 124, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062C\u064F\u0639\u0650\u0644\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u06E1\u062A\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0641\u0650\u064A\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 125, text: "\u0671\u062F\u06E1\u0639\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u0639\u0650\u0638\u064E\u0629\u0650 \u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0650\u06D6 \u0648\u064E\u062C\u064E\u0670\u062F\u0650\u0644\u06E1\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0647\u0650\u064A\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0646 \u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 126, text: "\u0648\u064E\u0625\u0650\u0646\u06E1 \u0639\u064E\u0627\u0642\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0639\u064E\u0627\u0642\u0650\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u0650\u062B\u06E1\u0644\u0650 \u0645\u064E\u0627 \u0639\u064F\u0648\u0642\u0650\u0628\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0635\u064E\u0628\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 127, text: "\u0648\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0635\u064E\u0628\u06E1\u0631\u064F\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F \u0641\u0650\u064A \u0636\u064E\u064A\u06E1\u0642\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 128, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645 \u0645\u0651\u064F\u062D\u06E1\u0633\u0650\u0646\u064F\u0648\u0646\u064E" }] }, { id: 17, name: "\u0627\u0644\u0625\u0633\u0631\u0627\u0621", transliteration: "Al-Isra", type: "meccan", total_verses: 111, verses: [{ id: 1, text: "\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0633\u06E1\u0631\u064E\u0649\u0670 \u0628\u0650\u0639\u064E\u0628\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0644\u064E\u064A\u06E1\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u0635\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u064E\u0670\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u062D\u064E\u0648\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0644\u0650\u0646\u064F\u0631\u0650\u064A\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0628\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 2, text: "\u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0647\u064F\u062F\u0657\u0649 \u0644\u0651\u0650\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u064A \u0648\u064E\u0643\u0650\u064A\u0644\u0657\u0627" }, { id: 3, text: "\u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u064E \u0645\u064E\u0646\u06E1 \u062D\u064E\u0645\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0639\u064E \u0646\u064F\u0648\u062D\u064D\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0628\u06E1\u062F\u0657\u0627 \u0634\u064E\u0643\u064F\u0648\u0631\u0657\u0627" }, { id: 4, text: "\u0648\u064E\u0642\u064E\u0636\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u062A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0646\u0651\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064E\u0631\u0651\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0644\u064E\u062A\u064E\u0639\u06E1\u0644\u064F\u0646\u0651\u064E \u0639\u064F\u0644\u064F\u0648\u0651\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 5, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0639\u06E1\u062F\u064F \u0623\u064F\u0648\u0644\u064E\u0649\u0670\u0647\u064F\u0645\u064E\u0627 \u0628\u064E\u0639\u064E\u062B\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0657\u0627 \u0644\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0628\u064E\u0623\u06E1\u0633\u0656 \u0634\u064E\u062F\u0650\u064A\u062F\u0656 \u0641\u064E\u062C\u064E\u0627\u0633\u064F\u0648\u0627\u0652 \u062E\u0650\u0644\u064E\u0670\u0644\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u064E\u0627\u0631\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0648\u064E\u0639\u06E1\u062F\u0657\u0627 \u0645\u0651\u064E\u0641\u06E1\u0639\u064F\u0648\u0644\u0657\u0627" }, { id: 6, text: "\u062B\u064F\u0645\u0651\u064E \u0631\u064E\u062F\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0631\u0651\u064E\u0629\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0645\u06E1\u062F\u064E\u062F\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0656 \u0648\u064E\u0628\u064E\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0646\u064E\u0641\u0650\u064A\u0631\u064B\u0627" }, { id: 7, text: "\u0625\u0650\u0646\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0633\u064E\u0623\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0647\u064E\u0627\u06DA \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0639\u06E1\u062F\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0644\u0650\u064A\u064E\u0633\u064F\u0640\u0654\u064F\u0648\u0627\u0652 \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u064E \u0643\u064E\u0645\u064E\u0627 \u062F\u064E\u062E\u064E\u0644\u064F\u0648\u0647\u064F \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u0656 \u0648\u064E\u0644\u0650\u064A\u064F\u062A\u064E\u0628\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0648\u06E1\u0627\u0652 \u062A\u064E\u062A\u06E1\u0628\u0650\u064A\u0631\u064B\u0627" }, { id: 8, text: "\u0639\u064E\u0633\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u0631\u06E1\u062D\u064E\u0645\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0625\u0650\u0646\u06E1 \u0639\u064F\u062F\u062A\u0651\u064F\u0645\u06E1 \u0639\u064F\u062F\u06E1\u0646\u064E\u0627\u06DA \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u062D\u064E\u0635\u0650\u064A\u0631\u064B\u0627" }, { id: 9, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0644\u0650\u0644\u0651\u064E\u062A\u0650\u064A \u0647\u0650\u064A\u064E \u0623\u064E\u0642\u06E1\u0648\u064E\u0645\u064F \u0648\u064E\u064A\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 10, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 11, text: "\u0648\u064E\u064A\u064E\u062F\u06E1\u0639\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0628\u0650\u0671\u0644\u0634\u0651\u064E\u0631\u0651\u0650 \u062F\u064F\u0639\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650\u06D6 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0639\u064E\u062C\u064F\u0648\u0644\u0657\u0627" }, { id: 12, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0621\u064E\u0627\u064A\u064E\u062A\u064E\u064A\u06E1\u0646\u0650\u06D6 \u0641\u064E\u0645\u064E\u062D\u064E\u0648\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u064E \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0645\u064F\u0628\u06E1\u0635\u0650\u0631\u064E\u0629\u0657 \u0644\u0651\u0650\u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0641\u064E\u0636\u06E1\u0644\u0657\u0627 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0639\u064E\u062F\u064E\u062F\u064E \u0671\u0644\u0633\u0651\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u064E\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0635\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u062A\u064E\u0641\u06E1\u0635\u0650\u064A\u0644\u0657\u0627" }, { id: 13, text: "\u0648\u064E\u0643\u064F\u0644\u0651\u064E \u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064D \u0623\u064E\u0644\u06E1\u0632\u064E\u0645\u06E1\u0646\u064E\u0670\u0647\u064F \u0637\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0639\u064F\u0646\u064F\u0642\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0646\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0644\u064E\u0647\u064F\u06E5 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627 \u064A\u064E\u0644\u06E1\u0642\u064E\u0649\u0670\u0647\u064F \u0645\u064E\u0646\u0634\u064F\u0648\u0631\u064B\u0627" }, { id: 14, text: "\u0671\u0642\u06E1\u0631\u064E\u0623\u06E1 \u0643\u0650\u062A\u064E\u0670\u0628\u064E\u0643\u064E \u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0643\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u062D\u064E\u0633\u0650\u064A\u0628\u0657\u0627" }, { id: 15, text: "\u0645\u0651\u064E\u0646\u0650 \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0649\u0670 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u0650\u064A \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0636\u064E\u0644\u0651\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0636\u0650\u0644\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0632\u0650\u0631\u064F \u0648\u064E\u0627\u0632\u0650\u0631\u064E\u0629\u065E \u0648\u0650\u0632\u06E1\u0631\u064E \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0646\u064E\u0628\u06E1\u0639\u064E\u062B\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627" }, { id: 16, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064F\u0647\u06E1\u0644\u0650\u0643\u064E \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064B \u0623\u064E\u0645\u064E\u0631\u06E1\u0646\u064E\u0627 \u0645\u064F\u062A\u06E1\u0631\u064E\u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u0641\u064E\u0633\u064E\u0642\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u062D\u064E\u0642\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0641\u064E\u062F\u064E\u0645\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u062A\u064E\u062F\u06E1\u0645\u0650\u064A\u0631\u0657\u0627" }, { id: 17, text: "\u0648\u064E\u0643\u064E\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064F\u0648\u0646\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0646\u064F\u0648\u062D\u0656\u06D7 \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u062E\u064E\u0628\u0650\u064A\u0631\u064E\u06E2\u0627 \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 18, text: "\u0645\u0651\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u064E\u0627\u062C\u0650\u0644\u064E\u0629\u064E \u0639\u064E\u062C\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0627 \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0644\u0650\u0645\u064E\u0646 \u0646\u0651\u064F\u0631\u0650\u064A\u062F\u064F \u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u064A\u064E\u0635\u06E1\u0644\u064E\u0649\u0670\u0647\u064E\u0627 \u0645\u064E\u0630\u06E1\u0645\u064F\u0648\u0645\u0657\u0627 \u0645\u0651\u064E\u062F\u06E1\u062D\u064F\u0648\u0631\u0657\u0627" }, { id: 19, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E \u0648\u064E\u0633\u064E\u0639\u064E\u0649\u0670 \u0644\u064E\u0647\u064E\u0627 \u0633\u064E\u0639\u06E1\u064A\u064E\u0647\u064E\u0627 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u065E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0643\u064E\u0627\u0646\u064E \u0633\u064E\u0639\u06E1\u064A\u064F\u0647\u064F\u0645 \u0645\u0651\u064E\u0634\u06E1\u0643\u064F\u0648\u0631\u0657\u0627" }, { id: 20, text: "\u0643\u064F\u0644\u0651\u0657\u0627 \u0646\u0651\u064F\u0645\u0650\u062F\u0651\u064F \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0645\u0650\u0646\u06E1 \u0639\u064E\u0637\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0637\u064E\u0627\u0653\u0621\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0645\u064E\u062D\u06E1\u0638\u064F\u0648\u0631\u064B\u0627" }, { id: 21, text: "\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0641\u064E\u0636\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u0648\u064E\u0644\u064E\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064F \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u0656 \u0648\u064E\u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u062A\u064E\u0641\u06E1\u0636\u0650\u064A\u0644\u0657\u0627" }, { id: 22, text: "\u0644\u0651\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u064E \u0641\u064E\u062A\u064E\u0642\u06E1\u0639\u064F\u062F\u064E \u0645\u064E\u0630\u06E1\u0645\u064F\u0648\u0645\u0657\u0627 \u0645\u0651\u064E\u062E\u06E1\u0630\u064F\u0648\u0644\u0657\u0627" }, { id: 23, text: "\u06DE\u0648\u064E\u0642\u064E\u0636\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u064A\u0651\u064E\u0627\u0647\u064F \u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0646\u0650 \u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u064B\u0627\u06DA \u0625\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0628\u06E1\u0644\u064F\u063A\u064E\u0646\u0651\u064E \u0639\u0650\u0646\u062F\u064E\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u0628\u064E\u0631\u064E \u0623\u064E\u062D\u064E\u062F\u064F\u0647\u064F\u0645\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0643\u0650\u0644\u064E\u0627\u0647\u064F\u0645\u064E\u0627 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u064F\u0644 \u0644\u0651\u064E\u0647\u064F\u0645\u064E\u0627\u0653 \u0623\u064F\u0641\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u06E1\u0647\u064E\u0631\u06E1\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u0642\u064F\u0644 \u0644\u0651\u064E\u0647\u064F\u0645\u064E\u0627 \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0643\u064E\u0631\u0650\u064A\u0645\u0657\u0627" }, { id: 24, text: "\u0648\u064E\u0671\u062E\u06E1\u0641\u0650\u0636\u06E1 \u0644\u064E\u0647\u064F\u0645\u064E\u0627 \u062C\u064E\u0646\u064E\u0627\u062D\u064E \u0671\u0644\u0630\u0651\u064F\u0644\u0651\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u0650 \u0648\u064E\u0642\u064F\u0644 \u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u0631\u06E1\u062D\u064E\u0645\u06E1\u0647\u064F\u0645\u064E\u0627 \u0643\u064E\u0645\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u064A\u064E\u0627\u0646\u0650\u064A \u0635\u064E\u063A\u0650\u064A\u0631\u0657\u0627" }, { id: 25, text: "\u0631\u0651\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u0641\u0650\u064A \u0646\u064F\u0641\u064F\u0648\u0633\u0650\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0635\u064E\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0640\u0670\u0628\u0650\u064A\u0646\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 26, text: "\u0648\u064E\u0621\u064E\u0627\u062A\u0650 \u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u062D\u064E\u0642\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u06E1\u0645\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0628\u06E1\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0628\u064E\u0630\u0651\u0650\u0631\u06E1 \u062A\u064E\u0628\u06E1\u0630\u0650\u064A\u0631\u064B\u0627" }, { id: 27, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0628\u064E\u0630\u0651\u0650\u0631\u0650\u064A\u0646\u064E \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u0650\u06D6 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0643\u064E\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 28, text: "\u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u062A\u064F\u0639\u06E1\u0631\u0650\u0636\u064E\u0646\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u062A\u064E\u0631\u06E1\u062C\u064F\u0648\u0647\u064E\u0627 \u0641\u064E\u0642\u064F\u0644 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0645\u0651\u064E\u064A\u06E1\u0633\u064F\u0648\u0631\u0657\u0627" }, { id: 29, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1 \u064A\u064E\u062F\u064E\u0643\u064E \u0645\u064E\u063A\u06E1\u0644\u064F\u0648\u0644\u064E\u0629\u064B \u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064F\u0646\u064F\u0642\u0650\u0643\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u0633\u064F\u0637\u06E1\u0647\u064E\u0627 \u0643\u064F\u0644\u0651\u064E \u0671\u0644\u06E1\u0628\u064E\u0633\u06E1\u0637\u0650 \u0641\u064E\u062A\u064E\u0642\u06E1\u0639\u064F\u062F\u064E \u0645\u064E\u0644\u064F\u0648\u0645\u0657\u0627 \u0645\u0651\u064E\u062D\u06E1\u0633\u064F\u0648\u0631\u064B\u0627" }, { id: 30, text: "\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u062E\u064E\u0628\u0650\u064A\u0631\u064E\u06E2\u0627 \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 31, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064E\u0643\u064F\u0645\u06E1 \u062E\u064E\u0634\u06E1\u064A\u064E\u0629\u064E \u0625\u0650\u0645\u06E1\u0644\u064E\u0670\u0642\u0656\u06D6 \u0646\u0651\u064E\u062D\u06E1\u0646\u064F \u0646\u064E\u0631\u06E1\u0632\u064F\u0642\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u064A\u0651\u064E\u0627\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0642\u064E\u062A\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064E \u062E\u0650\u0637\u06E1\u0640\u0654\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 32, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u0632\u0651\u0650\u0646\u064E\u0649\u0670\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u0657 \u0648\u064E\u0633\u064E\u0627\u0653\u0621\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 33, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0641\u06E1\u0633\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D7 \u0648\u064E\u0645\u064E\u0646 \u0642\u064F\u062A\u0650\u0644\u064E \u0645\u064E\u0638\u06E1\u0644\u064F\u0648\u0645\u0657\u0627 \u0641\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0648\u064E\u0644\u0650\u064A\u0651\u0650\u0647\u0650\u06E6 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u0633\u06E1\u0631\u0650\u0641 \u0641\u0651\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u062A\u06E1\u0644\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u0646\u0635\u064F\u0648\u0631\u0657\u0627" }, { id: 34, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u064A\u064E\u062A\u0650\u064A\u0645\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0647\u0650\u064A\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0628\u06E1\u0644\u064F\u063A\u064E \u0623\u064E\u0634\u064F\u062F\u0651\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0623\u064E\u0648\u06E1\u0641\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0647\u06E1\u062F\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0639\u064E\u0647\u06E1\u062F\u064E \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u0633\u06E1\u0640\u0654\u064F\u0648\u0644\u0657\u0627" }, { id: 35, text: "\u0648\u064E\u0623\u064E\u0648\u06E1\u0641\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u064E\u064A\u06E1\u0644\u064E \u0625\u0650\u0630\u064E\u0627 \u0643\u0650\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0632\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u064E\u0627\u0633\u0650 \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0648\u064E\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u0657\u0627" }, { id: 36, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0641\u064F \u0645\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u064C\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u064E \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0635\u064E\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0641\u064F\u0624\u064E\u0627\u062F\u064E \u0643\u064F\u0644\u0651\u064F \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0646\u06E1\u0647\u064F \u0645\u064E\u0633\u06E1\u0640\u0654\u064F\u0648\u0644\u0657\u0627" }, { id: 37, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u06E1\u0634\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064E\u0631\u064E\u062D\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0646 \u062A\u064E\u062E\u06E1\u0631\u0650\u0642\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0644\u064E\u0646 \u062A\u064E\u0628\u06E1\u0644\u064F\u063A\u064E \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064E \u0637\u064F\u0648\u0644\u0657\u0627" }, { id: 38, text: "\u0643\u064F\u0644\u0651\u064F \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0643\u064E\u0627\u0646\u064E \u0633\u064E\u064A\u0651\u0650\u0626\u064F\u0647\u064F\u06E5 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0645\u064E\u0643\u06E1\u0631\u064F\u0648\u0647\u0657\u0627" }, { id: 39, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u0650\u06D7 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u064E \u0641\u064E\u062A\u064F\u0644\u06E1\u0642\u064E\u0649\u0670 \u0641\u0650\u064A \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0645\u064E\u0644\u064F\u0648\u0645\u0657\u0627 \u0645\u0651\u064E\u062F\u06E1\u062D\u064F\u0648\u0631\u064B\u0627" }, { id: 40, text: "\u0623\u064E\u0641\u064E\u0623\u064E\u0635\u06E1\u0641\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0625\u0650\u0646\u064E\u0670\u062B\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0642\u064E\u0648\u06E1\u0644\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 41, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0635\u064E\u0631\u0651\u064E\u0641\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0644\u0650\u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0632\u0650\u064A\u062F\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064F\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 42, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5\u0653 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u065E \u0643\u064E\u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0671\u0628\u06E1\u062A\u064E\u063A\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0630\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 43, text: "\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649\u0670 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0639\u064F\u0644\u064F\u0648\u0651\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 44, text: "\u062A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F \u0644\u064E\u0647\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u064F \u0671\u0644\u0633\u0651\u064E\u0628\u06E1\u0639\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0648\u064E\u0645\u064E\u0646 \u0641\u0650\u064A\u0647\u0650\u0646\u0651\u064E\u06DA \u0648\u064E\u0625\u0650\u0646 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u064E\u0627 \u062A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E \u062A\u064E\u0633\u06E1\u0628\u0650\u064A\u062D\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u062D\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 45, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0631\u064E\u0623\u06E1\u062A\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064E \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u062D\u0650\u062C\u064E\u0627\u0628\u0657\u0627 \u0645\u0651\u064E\u0633\u06E1\u062A\u064F\u0648\u0631\u0657\u0627" }, { id: 46, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0643\u0650\u0646\u0651\u064E\u0629\u064B \u0623\u064E\u0646 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0647\u064F \u0648\u064E\u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0642\u06E1\u0631\u0657\u0627\u06DA \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0630\u064E\u0643\u064E\u0631\u06E1\u062A\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0648\u064E\u062D\u06E1\u062F\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062F\u06E1\u0628\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u0646\u064F\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 47, text: "\u0646\u0651\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0630\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0625\u0650\u0630\u06E1 \u0647\u064F\u0645\u06E1 \u0646\u064E\u062C\u06E1\u0648\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0625\u0650\u0646 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u062C\u064F\u0644\u0657\u0627 \u0645\u0651\u064E\u0633\u06E1\u062D\u064F\u0648\u0631\u064B\u0627" }, { id: 48, text: "\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0636\u064E\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u062B\u064E\u0627\u0644\u064E \u0641\u064E\u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 49, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0639\u0650\u0638\u064E\u0670\u0645\u0657\u0627 \u0648\u064E\u0631\u064F\u0641\u064E\u0670\u062A\u064B\u0627 \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064E\u0628\u06E1\u0639\u064F\u0648\u062B\u064F\u0648\u0646\u064E \u062E\u064E\u0644\u06E1\u0642\u0657\u0627 \u062C\u064E\u062F\u0650\u064A\u062F\u0657\u0627" }, { id: 50, text: "\u06DE\u0642\u064F\u0644\u06E1 \u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u062D\u0650\u062C\u064E\u0627\u0631\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u062D\u064E\u062F\u0650\u064A\u062F\u064B\u0627" }, { id: 51, text: "\u0623\u064E\u0648\u06E1 \u062E\u064E\u0644\u06E1\u0642\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0643\u06E1\u0628\u064F\u0631\u064F \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650\u0643\u064F\u0645\u06E1\u06DA \u0641\u064E\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u0646 \u064A\u064F\u0639\u0650\u064A\u062F\u064F\u0646\u064E\u0627\u06D6 \u0642\u064F\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u064E\u0637\u064E\u0631\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u0656\u06DA \u0641\u064E\u0633\u064E\u064A\u064F\u0646\u06E1\u063A\u0650\u0636\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0631\u064F\u0621\u064F\u0648\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u062A\u064E\u0649\u0670 \u0647\u064F\u0648\u064E\u06D6 \u0642\u064F\u0644\u06E1 \u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0642\u064E\u0631\u0650\u064A\u0628\u0657\u0627" }, { id: 52, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0643\u064F\u0645\u06E1 \u0641\u064E\u062A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0646\u064E \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u062A\u064E\u0638\u064F\u0646\u0651\u064F\u0648\u0646\u064E \u0625\u0650\u0646 \u0644\u0651\u064E\u0628\u0650\u062B\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 53, text: "\u0648\u064E\u0642\u064F\u0644 \u0644\u0651\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0647\u0650\u064A\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064E \u064A\u064E\u0646\u0632\u064E\u063A\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064E \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u0650 \u0639\u064E\u062F\u064F\u0648\u0651\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 54, text: "\u0631\u0651\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646 \u064A\u064E\u0634\u064E\u0623\u06E1 \u064A\u064E\u0631\u06E1\u062D\u064E\u0645\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0625\u0650\u0646 \u064A\u064E\u0634\u064E\u0623\u06E1 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u06E1\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0643\u0650\u064A\u0644\u0657\u0627" }, { id: 55, text: "\u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0641\u064E\u0636\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656\u06D6 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0632\u064E\u0628\u064F\u0648\u0631\u0657\u0627" }, { id: 56, text: "\u0642\u064F\u0644\u0650 \u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0632\u064E\u0639\u064E\u0645\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0643\u064E\u0634\u06E1\u0641\u064E \u0671\u0644\u0636\u0651\u064F\u0631\u0651\u0650 \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0648\u0650\u064A\u0644\u064B\u0627" }, { id: 57, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u064A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0648\u064E\u0633\u0650\u064A\u0644\u064E\u0629\u064E \u0623\u064E\u064A\u0651\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F \u0648\u064E\u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064E\u0647\u064F\u06E5 \u0648\u064E\u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u062D\u06E1\u0630\u064F\u0648\u0631\u0657\u0627" }, { id: 58, text: "\u0648\u064E\u0625\u0650\u0646 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0645\u064F\u0647\u06E1\u0644\u0650\u0643\u064F\u0648\u0647\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0623\u064E\u0648\u06E1 \u0645\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0647\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u0657\u0627\u06DA \u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u064E\u0633\u06E1\u0637\u064F\u0648\u0631\u0657\u0627" }, { id: 59, text: "\u0648\u064E\u0645\u064E\u0627 \u0645\u064E\u0646\u064E\u0639\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0628\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u062B\u064E\u0645\u064F\u0648\u062F\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0642\u064E\u0629\u064E \u0645\u064F\u0628\u06E1\u0635\u0650\u0631\u064E\u0629\u0657 \u0641\u064E\u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u0646\u064F\u0631\u06E1\u0633\u0650\u0644\u064F \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u062E\u06E1\u0648\u0650\u064A\u0641\u0657\u0627" }, { id: 60, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064E \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0623\u064E\u062D\u064E\u0627\u0637\u064E \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0631\u0651\u064F\u0621\u06E1\u064A\u064E\u0627 \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u0631\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u064E\u0629\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u06E1\u0639\u064F\u0648\u0646\u064E\u0629\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650\u06DA \u0648\u064E\u0646\u064F\u062E\u064E\u0648\u0651\u0650\u0641\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0645\u064E\u0627 \u064A\u064E\u0632\u0650\u064A\u062F\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0637\u064F\u063A\u06E1\u064A\u064E\u0670\u0646\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 61, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0671\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652 \u0644\u0650\u0623\u0653\u062F\u064E\u0645\u064E \u0641\u064E\u0633\u064E\u062C\u064E\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064E \u0642\u064E\u0627\u0644\u064E \u0621\u064E\u0623\u064E\u0633\u06E1\u062C\u064F\u062F\u064F \u0644\u0650\u0645\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064E \u0637\u0650\u064A\u0646\u0657\u0627" }, { id: 62, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E\u0643\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064E\u0631\u0651\u064E\u0645\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u062E\u0651\u064E\u0631\u06E1\u062A\u064E\u0646\u0650 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0644\u064E\u0623\u064E\u062D\u06E1\u062A\u064E\u0646\u0650\u0643\u064E\u0646\u0651\u064E \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 63, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0630\u06E1\u0647\u064E\u0628\u06E1 \u0641\u064E\u0645\u064E\u0646 \u062A\u064E\u0628\u0650\u0639\u064E\u0643\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u0657 \u0645\u0651\u064E\u0648\u06E1\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 64, text: "\u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0641\u06E1\u0632\u0650\u0632\u06E1 \u0645\u064E\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0639\u06E1\u062A\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0628\u0650\u0635\u064E\u0648\u06E1\u062A\u0650\u0643\u064E \u0648\u064E\u0623\u064E\u062C\u06E1\u0644\u0650\u0628\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u062E\u064E\u064A\u06E1\u0644\u0650\u0643\u064E \u0648\u064E\u0631\u064E\u062C\u0650\u0644\u0650\u0643\u064E \u0648\u064E\u0634\u064E\u0627\u0631\u0650\u0643\u06E1\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u0650 \u0648\u064E\u0639\u0650\u062F\u06E1\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u0650\u062F\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u063A\u064F\u0631\u064F\u0648\u0631\u064B\u0627" }, { id: 65, text: "\u0625\u0650\u0646\u0651\u064E \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u065E\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0648\u064E\u0643\u0650\u064A\u0644\u0657\u0627" }, { id: 66, text: "\u0631\u0651\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0632\u06E1\u062C\u0650\u064A \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0644\u0650\u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0631\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 67, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0636\u0651\u064F\u0631\u0651\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0636\u064E\u0644\u0651\u064E \u0645\u064E\u0646 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u064A\u0651\u064E\u0627\u0647\u064F\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0646\u064E\u062C\u0651\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u06E1\u062A\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0643\u064E\u0641\u064F\u0648\u0631\u064B\u0627" }, { id: 68, text: "\u0623\u064E\u0641\u064E\u0623\u064E\u0645\u0650\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u062E\u06E1\u0633\u0650\u0641\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u062C\u064E\u0627\u0646\u0650\u0628\u064E \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0623\u064E\u0648\u06E1 \u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062D\u064E\u0627\u0635\u0650\u0628\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u062A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0643\u0650\u064A\u0644\u064B\u0627" }, { id: 69, text: "\u0623\u064E\u0645\u06E1 \u0623\u064E\u0645\u0650\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064F\u0639\u0650\u064A\u062F\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u062A\u064E\u0627\u0631\u064E\u0629\u064B \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670 \u0641\u064E\u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0642\u064E\u0627\u0635\u0650\u0641\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u064A\u062D\u0650 \u0641\u064E\u064A\u064F\u063A\u06E1\u0631\u0650\u0642\u064E\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0641\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u062A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u062A\u064E\u0628\u0650\u064A\u0639\u0657\u0627" }, { id: 70, text: "\u06DE\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0631\u0651\u064E\u0645\u06E1\u0646\u064E\u0627 \u0628\u064E\u0646\u0650\u064A\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0648\u064E\u062D\u064E\u0645\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0648\u064E\u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0648\u064E\u0641\u064E\u0636\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064E\u062B\u0650\u064A\u0631\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u062A\u064E\u0641\u06E1\u0636\u0650\u064A\u0644\u0657\u0627" }, { id: 71, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0643\u064F\u0644\u0651\u064E \u0623\u064F\u0646\u064E\u0627\u0633\u0650\u06ED \u0628\u0650\u0625\u0650\u0645\u064E\u0670\u0645\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0645\u064E\u0646\u06E1 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u064E\u0647\u064F\u06E5 \u0628\u0650\u064A\u064E\u0645\u0650\u064A\u0646\u0650\u0647\u0650\u06E6 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064E\u0642\u06E1\u0631\u064E\u0621\u064F\u0648\u0646\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0641\u064E\u062A\u0650\u064A\u0644\u0657\u0627" }, { id: 72, text: "\u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670 \u0641\u064E\u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u0636\u064E\u0644\u0651\u064F \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 73, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0644\u064E\u064A\u064E\u0641\u06E1\u062A\u0650\u0646\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0644\u0650\u062A\u064E\u0641\u06E1\u062A\u064E\u0631\u0650\u064A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0643\u064E \u062E\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 74, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u062B\u064E\u0628\u0651\u064E\u062A\u06E1\u0646\u064E\u0670\u0643\u064E \u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u0650\u062F\u062A\u0651\u064E \u062A\u064E\u0631\u06E1\u0643\u064E\u0646\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627" }, { id: 75, text: "\u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0623\u064E\u0630\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064E \u0636\u0650\u0639\u06E1\u0641\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0636\u0650\u0639\u06E1\u0641\u064E \u0671\u0644\u06E1\u0645\u064E\u0645\u064E\u0627\u062A\u0650 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u062A\u064E\u062C\u0650\u062F\u064F \u0644\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 76, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0644\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u0641\u0650\u0632\u0651\u064F\u0648\u0646\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0644\u0650\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0643\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0627 \u064A\u064E\u0644\u06E1\u0628\u064E\u062B\u064F\u0648\u0646\u064E \u062E\u0650\u0644\u064E\u0670\u0641\u064E\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 77, text: "\u0633\u064F\u0646\u0651\u064E\u0629\u064E \u0645\u064E\u0646 \u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064F\u0633\u064F\u0644\u0650\u0646\u064E\u0627\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u0650\u062F\u064F \u0644\u0650\u0633\u064F\u0646\u0651\u064E\u062A\u0650\u0646\u064E\u0627 \u062A\u064E\u062D\u06E1\u0648\u0650\u064A\u0644\u064B\u0627" }, { id: 78, text: "\u0623\u064E\u0642\u0650\u0645\u0650 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0644\u0650\u062F\u064F\u0644\u064F\u0648\u0643\u0650 \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u0650 \u0625\u0650\u0644\u064E\u0649\u0670 \u063A\u064E\u0633\u064E\u0642\u0650 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0641\u064E\u062C\u06E1\u0631\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E \u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0641\u064E\u062C\u06E1\u0631\u0650 \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u0634\u06E1\u0647\u064F\u0648\u062F\u0657\u0627" }, { id: 79, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0641\u064E\u062A\u064E\u0647\u064E\u062C\u0651\u064E\u062F\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0646\u064E\u0627\u0641\u0650\u0644\u064E\u0629\u0657 \u0644\u0651\u064E\u0643\u064E \u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064E\u0643\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0645\u064E\u0642\u064E\u0627\u0645\u0657\u0627 \u0645\u0651\u064E\u062D\u06E1\u0645\u064F\u0648\u062F\u0657\u0627" }, { id: 80, text: "\u0648\u064E\u0642\u064F\u0644 \u0631\u0651\u064E\u0628\u0651\u0650 \u0623\u064E\u062F\u06E1\u062E\u0650\u0644\u06E1\u0646\u0650\u064A \u0645\u064F\u062F\u06E1\u062E\u064E\u0644\u064E \u0635\u0650\u062F\u06E1\u0642\u0656 \u0648\u064E\u0623\u064E\u062E\u06E1\u0631\u0650\u062C\u06E1\u0646\u0650\u064A \u0645\u064F\u062E\u06E1\u0631\u064E\u062C\u064E \u0635\u0650\u062F\u06E1\u0642\u0656 \u0648\u064E\u0671\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u0650\u064A \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0643\u064E \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0646\u0651\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 81, text: "\u0648\u064E\u0642\u064F\u0644\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0632\u064E\u0647\u064E\u0642\u064E \u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u064E \u0643\u064E\u0627\u0646\u064E \u0632\u064E\u0647\u064F\u0648\u0642\u0657\u0627" }, { id: 82, text: "\u0648\u064E\u0646\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0634\u0650\u0641\u064E\u0627\u0653\u0621\u065E \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0632\u0650\u064A\u062F\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u062E\u064E\u0633\u064E\u0627\u0631\u0657\u0627" }, { id: 83, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u0650 \u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064E \u0648\u064E\u0646\u064E\u0640\u0654\u064E\u0627 \u0628\u0650\u062C\u064E\u0627\u0646\u0650\u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E\u0647\u064F \u0671\u0644\u0634\u0651\u064E\u0631\u0651\u064F \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0640\u0654\u064F\u0648\u0633\u0657\u0627" }, { id: 84, text: "\u0642\u064F\u0644\u06E1 \u0643\u064F\u0644\u0651\u065E \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u0627\u0643\u0650\u0644\u064E\u062A\u0650\u0647\u0650\u06E6 \u0641\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0623\u064E\u0647\u06E1\u062F\u064E\u0649\u0670 \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 85, text: "\u0648\u064E\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u0631\u0651\u064F\u0648\u062D\u0650\u06D6 \u0642\u064F\u0644\u0650 \u0671\u0644\u0631\u0651\u064F\u0648\u062D\u064F \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 86, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0634\u0650\u0626\u06E1\u0646\u064E\u0627 \u0644\u064E\u0646\u064E\u0630\u06E1\u0647\u064E\u0628\u064E\u0646\u0651\u064E \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u062A\u064E\u062C\u0650\u062F\u064F \u0644\u064E\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0643\u0650\u064A\u0644\u064B\u0627" }, { id: 87, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u064E\u0636\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 88, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0626\u0650\u0646\u0650 \u0671\u062C\u06E1\u062A\u064E\u0645\u064E\u0639\u064E\u062A\u0650 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064F \u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064F \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u0650\u062B\u06E1\u0644\u0650 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0628\u0650\u0645\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0644\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0638\u064E\u0647\u0650\u064A\u0631\u0657\u0627" }, { id: 89, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0635\u064E\u0631\u0651\u064E\u0641\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u062B\u064E\u0644\u0656 \u0641\u064E\u0623\u064E\u0628\u064E\u0649\u0670\u0653 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064F\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 90, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u0646\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E \u0644\u064E\u0643\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0641\u06E1\u062C\u064F\u0631\u064E \u0644\u064E\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u064A\u064E\u0646\u06E2\u0628\u064F\u0648\u0639\u064B\u0627" }, { id: 91, text: "\u0623\u064E\u0648\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u064E\u0643\u064E \u062C\u064E\u0646\u0651\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u062E\u0650\u064A\u0644\u0656 \u0648\u064E\u0639\u0650\u0646\u064E\u0628\u0656 \u0641\u064E\u062A\u064F\u0641\u064E\u062C\u0651\u0650\u0631\u064E \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064E \u062E\u0650\u0644\u064E\u0670\u0644\u064E\u0647\u064E\u0627 \u062A\u064E\u0641\u06E1\u062C\u0650\u064A\u0631\u064B\u0627" }, { id: 92, text: "\u0623\u064E\u0648\u06E1 \u062A\u064F\u0633\u06E1\u0642\u0650\u0637\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0643\u064E\u0645\u064E\u0627 \u0632\u064E\u0639\u064E\u0645\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0643\u0650\u0633\u064E\u0641\u064B\u0627 \u0623\u064E\u0648\u06E1 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0642\u064E\u0628\u0650\u064A\u0644\u064B\u0627" }, { id: 93, text: "\u0623\u064E\u0648\u06E1 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u064E\u0643\u064E \u0628\u064E\u064A\u06E1\u062A\u065E \u0645\u0651\u0650\u0646 \u0632\u064F\u062E\u06E1\u0631\u064F\u0641\u064D \u0623\u064E\u0648\u06E1 \u062A\u064E\u0631\u06E1\u0642\u064E\u0649\u0670 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0644\u064E\u0646 \u0646\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E \u0644\u0650\u0631\u064F\u0642\u0650\u064A\u0651\u0650\u0643\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627 \u0646\u0651\u064E\u0642\u06E1\u0631\u064E\u0624\u064F\u0647\u064F\u06E5\u06D7 \u0642\u064F\u0644\u06E1 \u0633\u064F\u0628\u06E1\u062D\u064E\u0627\u0646\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0647\u064E\u0644\u06E1 \u0643\u064F\u0646\u062A\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u0657\u0627 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0657\u0627" }, { id: 94, text: "\u0648\u064E\u0645\u064E\u0627 \u0645\u064E\u0646\u064E\u0639\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0623\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0628\u064E\u0639\u064E\u062B\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u0634\u064E\u0631\u0657\u0627 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0657\u0627" }, { id: 95, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u065E \u064A\u064E\u0645\u06E1\u0634\u064F\u0648\u0646\u064E \u0645\u064F\u0637\u06E1\u0645\u064E\u0626\u0650\u0646\u0651\u0650\u064A\u0646\u064E \u0644\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0644\u064E\u0643\u0657\u0627 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0657\u0627" }, { id: 96, text: "\u0642\u064F\u0644\u06E1 \u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u0647\u0650\u064A\u062F\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u062E\u064E\u0628\u0650\u064A\u0631\u064E\u06E2\u0627 \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 97, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u06E1 \u0641\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0646\u064E\u062D\u06E1\u0634\u064F\u0631\u064F\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064F\u062C\u064F\u0648\u0647\u0650\u0647\u0650\u0645\u06E1 \u0639\u064F\u0645\u06E1\u064A\u0657\u0627 \u0648\u064E\u0628\u064F\u0643\u06E1\u0645\u0657\u0627 \u0648\u064E\u0635\u064F\u0645\u0651\u0657\u0627\u06D6 \u0645\u0651\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F\u06D6 \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627 \u062E\u064E\u0628\u064E\u062A\u06E1 \u0632\u0650\u062F\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0633\u064E\u0639\u0650\u064A\u0631\u0657\u0627" }, { id: 98, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0639\u0650\u0638\u064E\u0670\u0645\u0657\u0627 \u0648\u064E\u0631\u064F\u0641\u064E\u0670\u062A\u064B\u0627 \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064E\u0628\u06E1\u0639\u064F\u0648\u062B\u064F\u0648\u0646\u064E \u062E\u064E\u0644\u06E1\u0642\u0657\u0627 \u062C\u064E\u062F\u0650\u064A\u062F\u064B\u0627" }, { id: 99, text: "\u06DE\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0642\u064E\u0627\u062F\u0650\u0631\u064C \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064E \u0645\u0650\u062B\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u064E\u0644\u0657\u0627 \u0644\u0651\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u0650 \u0641\u064E\u0623\u064E\u0628\u064E\u0649 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064F\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 100, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0648\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u062E\u064E\u0632\u064E\u0627\u0653\u0626\u0650\u0646\u064E \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0650 \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0623\u064E\u0645\u06E1\u0633\u064E\u0643\u06E1\u062A\u064F\u0645\u06E1 \u062E\u064E\u0634\u06E1\u064A\u064E\u0629\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0641\u064E\u0627\u0642\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0642\u064E\u062A\u064F\u0648\u0631\u0657\u0627" }, { id: 101, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u062A\u0650\u0633\u06E1\u0639\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u06ED \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656\u06D6 \u0641\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u06E1 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0623\u064E\u0638\u064F\u0646\u0651\u064F\u0643\u064E \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0645\u064E\u0633\u06E1\u062D\u064F\u0648\u0631\u0657\u0627" }, { id: 102, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0628\u064E\u0635\u064E\u0627\u0653\u0626\u0650\u0631\u064E \u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0623\u064E\u0638\u064F\u0646\u0651\u064F\u0643\u064E \u064A\u064E\u0670\u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0645\u064E\u062B\u06E1\u0628\u064F\u0648\u0631\u0657\u0627" }, { id: 103, text: "\u0641\u064E\u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0623\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0641\u0650\u0632\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0645\u064E\u0646 \u0645\u0651\u064E\u0639\u064E\u0647\u064F\u06E5 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627" }, { id: 104, text: "\u0648\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0644\u0650\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0671\u0633\u06E1\u0643\u064F\u0646\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0639\u06E1\u062F\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u062C\u0650\u0626\u06E1\u0646\u064E\u0627 \u0628\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0641\u0650\u064A\u0641\u0657\u0627" }, { id: 105, text: "\u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0646\u064E\u0632\u064E\u0644\u064E\u06D7 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u0657\u0627 \u0648\u064E\u0646\u064E\u0630\u0650\u064A\u0631\u0657\u0627" }, { id: 106, text: "\u0648\u064E\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0657\u0627 \u0641\u064E\u0631\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0644\u0650\u062A\u064E\u0642\u06E1\u0631\u064E\u0623\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064F\u0643\u06E1\u062B\u0656 \u0648\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u062A\u064E\u0646\u0632\u0650\u064A\u0644\u0657\u0627" }, { id: 107, text: "\u0642\u064F\u0644\u06E1 \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u06E1 \u0644\u064E\u0627 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0630\u064E\u0627 \u064A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u064A\u064E\u062E\u0650\u0631\u0651\u064F\u0648\u0646\u064E\u06E4 \u0644\u0650\u0644\u06E1\u0623\u064E\u0630\u06E1\u0642\u064E\u0627\u0646\u0650\u06E4 \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627\u06E4" }, { id: 108, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0648\u064E\u0639\u06E1\u062F\u064F \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0644\u064E\u0645\u064E\u0641\u06E1\u0639\u064F\u0648\u0644\u0657\u0627" }, { id: 109, text: "\u0648\u064E\u064A\u064E\u062E\u0650\u0631\u0651\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u06E1\u0623\u064E\u0630\u06E1\u0642\u064E\u0627\u0646\u0650 \u064A\u064E\u0628\u06E1\u0643\u064F\u0648\u0646\u064E \u0648\u064E\u064A\u064E\u0632\u0650\u064A\u062F\u064F\u0647\u064F\u0645\u06E1 \u062E\u064F\u0634\u064F\u0648\u0639\u0657\u0627\u06E9" }, { id: 110, text: "\u0642\u064F\u0644\u0650 \u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0623\u064E\u0648\u0650 \u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064E\u06D6 \u0623\u064E\u064A\u0651\u0657\u0627 \u0645\u0651\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0647\u064E\u0631\u06E1 \u0628\u0650\u0635\u064E\u0644\u064E\u0627\u062A\u0650\u0643\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062E\u064E\u0627\u0641\u0650\u062A\u06E1 \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0671\u0628\u06E1\u062A\u064E\u063A\u0650 \u0628\u064E\u064A\u06E1\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 111, text: "\u0648\u064E\u0642\u064F\u0644\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0645\u06E1 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u06E1 \u0648\u064E\u0644\u064E\u062F\u0657\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0634\u064E\u0631\u0650\u064A\u0643\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u0650 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u0650\u064A\u0651\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0630\u0651\u064F\u0644\u0651\u0650\u06D6 \u0648\u064E\u0643\u064E\u0628\u0651\u0650\u0631\u06E1\u0647\u064F \u062A\u064E\u0643\u06E1\u0628\u0650\u064A\u0631\u064E\u06E2\u0627" }] }, { id: 18, name: "\u0627\u0644\u0643\u0647\u0641", transliteration: "Al-Kahf", type: "meccan", total_verses: 110, verses: [{ id: 1, text: "\u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u0628\u06E1\u062F\u0650\u0647\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0639\u0650\u0648\u064E\u062C\u064E\u0627\u06DC" }, { id: 2, text: "\u0642\u064E\u064A\u0651\u0650\u0645\u0657\u0627 \u0644\u0651\u0650\u064A\u064F\u0646\u0630\u0650\u0631\u064E \u0628\u064E\u0623\u06E1\u0633\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u0657\u0627 \u0645\u0651\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u06E1\u0647\u064F \u0648\u064E\u064A\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627" }, { id: 3, text: "\u0645\u0651\u064E\u0640\u0670\u0643\u0650\u062B\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u0650 \u0623\u064E\u0628\u064E\u062F\u0657\u0627" }, { id: 4, text: "\u0648\u064E\u064A\u064F\u0646\u0630\u0650\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u064E\u062F\u0657\u0627" }, { id: 5, text: "\u0645\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0644\u06E1\u0645\u0656 \u0648\u064E\u0644\u064E\u0627 \u0644\u0650\u0623\u0653\u0628\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1\u06DA \u0643\u064E\u0628\u064F\u0631\u064E\u062A\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u0657 \u062A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646\u06E1 \u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0630\u0650\u0628\u0657\u0627" }, { id: 6, text: "\u0641\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064E \u0628\u064E\u0670\u062E\u0650\u0639\u065E \u0646\u0651\u064E\u0641\u06E1\u0633\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062B\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u062F\u0650\u064A\u062B\u0650 \u0623\u064E\u0633\u064E\u0641\u064B\u0627" }, { id: 7, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0632\u0650\u064A\u0646\u064E\u0629\u0657 \u0644\u0651\u064E\u0647\u064E\u0627 \u0644\u0650\u0646\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u064A\u0651\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0639\u064E\u0645\u064E\u0644\u0657\u0627" }, { id: 8, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u062C\u064E\u0670\u0639\u0650\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0635\u064E\u0639\u0650\u064A\u062F\u0657\u0627 \u062C\u064F\u0631\u064F\u0632\u064B\u0627" }, { id: 9, text: "\u0623\u064E\u0645\u06E1 \u062D\u064E\u0633\u0650\u0628\u06E1\u062A\u064E \u0623\u064E\u0646\u0651\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u06E1\u0643\u064E\u0647\u06E1\u0641\u0650 \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0642\u0650\u064A\u0645\u0650 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0639\u064E\u062C\u064E\u0628\u064B\u0627" }, { id: 10, text: "\u0625\u0650\u0630\u06E1 \u0623\u064E\u0648\u064E\u0649 \u0671\u0644\u06E1\u0641\u0650\u062A\u06E1\u064A\u064E\u0629\u064F \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0647\u06E1\u0641\u0650 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u0650\u0646\u064E\u0627 \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0643\u064E \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0648\u064E\u0647\u064E\u064A\u0651\u0650\u0626\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u0646\u064E\u0627 \u0631\u064E\u0634\u064E\u062F\u0657\u0627" }, { id: 11, text: "\u0641\u064E\u0636\u064E\u0631\u064E\u0628\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u0650\u0647\u0650\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u064E\u0647\u06E1\u0641\u0650 \u0633\u0650\u0646\u0650\u064A\u0646\u064E \u0639\u064E\u062F\u064E\u062F\u0657\u0627" }, { id: 12, text: "\u062B\u064F\u0645\u0651\u064E \u0628\u064E\u0639\u064E\u062B\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0644\u0650\u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0623\u064E\u064A\u0651\u064F \u0671\u0644\u06E1\u062D\u0650\u0632\u06E1\u0628\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u062D\u06E1\u0635\u064E\u0649\u0670 \u0644\u0650\u0645\u064E\u0627 \u0644\u064E\u0628\u0650\u062B\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u064E\u062F\u0657\u0627" }, { id: 13, text: "\u0646\u0651\u064E\u062D\u06E1\u0646\u064F \u0646\u064E\u0642\u064F\u0635\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0646\u064E\u0628\u064E\u0623\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u062A\u06E1\u064A\u064E\u0629\u064C \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0632\u0650\u062F\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0647\u064F\u062F\u0657\u0649" }, { id: 14, text: "\u0648\u064E\u0631\u064E\u0628\u064E\u0637\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0644\u064E\u0646 \u0646\u0651\u064E\u062F\u06E1\u0639\u064F\u0648\u064E\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u0657\u0627\u06D6 \u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0642\u064F\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0630\u0657\u0627 \u0634\u064E\u0637\u064E\u0637\u064B\u0627" }, { id: 15, text: "\u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0642\u064E\u0648\u06E1\u0645\u064F\u0646\u064E\u0627 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u0657\u06D6 \u0644\u0651\u064E\u0648\u06E1\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0650\u06ED \u0628\u064E\u064A\u0651\u0650\u0646\u0656\u06D6 \u0641\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u0657\u0627" }, { id: 16, text: "\u0648\u064E\u0625\u0650\u0630\u0650 \u0671\u0639\u06E1\u062A\u064E\u0632\u064E\u0644\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0623\u06E1\u0648\u064F\u06E5\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0647\u06E1\u0641\u0650 \u064A\u064E\u0646\u0634\u064F\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0647\u064E\u064A\u0651\u0650\u0626\u06E1 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0631\u06E1\u0641\u064E\u0642\u0657\u0627" }, { id: 17, text: "\u06DE\u0648\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0625\u0650\u0630\u064E\u0627 \u0637\u064E\u0644\u064E\u0639\u064E\u062A \u062A\u0651\u064E\u0632\u064E\u0670\u0648\u064E\u0631\u064F \u0639\u064E\u0646 \u0643\u064E\u0647\u06E1\u0641\u0650\u0647\u0650\u0645\u06E1 \u0630\u064E\u0627\u062A\u064E \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u063A\u064E\u0631\u064E\u0628\u064E\u062A \u062A\u0651\u064E\u0642\u06E1\u0631\u0650\u0636\u064F\u0647\u064F\u0645\u06E1 \u0630\u064E\u0627\u062A\u064E \u0671\u0644\u0634\u0651\u0650\u0645\u064E\u0627\u0644\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0641\u064E\u062C\u06E1\u0648\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0645\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u06E1 \u0641\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0645\u0651\u064F\u0631\u06E1\u0634\u0650\u062F\u0657\u0627" }, { id: 18, text: "\u0648\u064E\u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u064A\u06E1\u0642\u064E\u0627\u0638\u0657\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0631\u064F\u0642\u064F\u0648\u062F\u065E\u06DA \u0648\u064E\u0646\u064F\u0642\u064E\u0644\u0651\u0650\u0628\u064F\u0647\u064F\u0645\u06E1 \u0630\u064E\u0627\u062A\u064E \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650 \u0648\u064E\u0630\u064E\u0627\u062A\u064E \u0671\u0644\u0634\u0651\u0650\u0645\u064E\u0627\u0644\u0650\u06D6 \u0648\u064E\u0643\u064E\u0644\u06E1\u0628\u064F\u0647\u064F\u0645 \u0628\u064E\u0670\u0633\u0650\u0637\u065E \u0630\u0650\u0631\u064E\u0627\u0639\u064E\u064A\u06E1\u0647\u0650 \u0628\u0650\u0671\u0644\u06E1\u0648\u064E\u0635\u0650\u064A\u062F\u0650\u06DA \u0644\u064E\u0648\u0650 \u0671\u0637\u0651\u064E\u0644\u064E\u0639\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0644\u064E\u0648\u064E\u0644\u0651\u064E\u064A\u06E1\u062A\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u0650\u0631\u064E\u0627\u0631\u0657\u0627 \u0648\u064E\u0644\u064E\u0645\u064F\u0644\u0650\u0626\u06E1\u062A\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0639\u06E1\u0628\u0657\u0627" }, { id: 19, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u064E\u0639\u064E\u062B\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u062A\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0642\u064E\u0627\u0644\u064E \u0642\u064E\u0627\u0653\u0626\u0650\u0644\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0643\u064E\u0645\u06E1 \u0644\u064E\u0628\u0650\u062B\u06E1\u062A\u064F\u0645\u06E1\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0628\u0650\u062B\u06E1\u0646\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0628\u064E\u0639\u06E1\u0636\u064E \u064A\u064E\u0648\u06E1\u0645\u0656\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0628\u0650\u062B\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0671\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062D\u064E\u062F\u064E\u0643\u064F\u0645 \u0628\u0650\u0648\u064E\u0631\u0650\u0642\u0650\u0643\u064F\u0645\u06E1 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u0646\u0638\u064F\u0631\u06E1 \u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627\u0653 \u0623\u064E\u0632\u06E1\u0643\u064E\u0649\u0670 \u0637\u064E\u0639\u064E\u0627\u0645\u0657\u0627 \u0641\u064E\u0644\u06E1\u064A\u064E\u0623\u06E1\u062A\u0650\u0643\u064F\u0645 \u0628\u0650\u0631\u0650\u0632\u06E1\u0642\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0644\u064E\u0637\u0651\u064E\u0641\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0634\u06E1\u0639\u0650\u0631\u064E\u0646\u0651\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u062D\u064E\u062F\u064B\u0627" }, { id: 20, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646 \u064A\u064E\u0638\u06E1\u0647\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u064F\u0645\u064F\u0648\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u064A\u064F\u0639\u0650\u064A\u062F\u064F\u0648\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0645\u0650\u0644\u0651\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0646 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064B\u0627 \u0623\u064E\u0628\u064E\u062F\u0657\u0627" }, { id: 21, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0639\u06E1\u062B\u064E\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0644\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u065E \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0644\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0625\u0650\u0630\u06E1 \u064A\u064E\u062A\u064E\u0646\u064E\u0670\u0632\u064E\u0639\u064F\u0648\u0646\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0631\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0628\u06E1\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u064F\u0646\u06E1\u064A\u064E\u0670\u0646\u0657\u0627\u06D6 \u0631\u0651\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0647\u0650\u0645\u06E1\u06DA \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u063A\u064E\u0644\u064E\u0628\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0646\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064E\u0633\u06E1\u062C\u0650\u062F\u0657\u0627" }, { id: 22, text: "\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u065E \u0631\u0651\u064E\u0627\u0628\u0650\u0639\u064F\u0647\u064F\u0645\u06E1 \u0643\u064E\u0644\u06E1\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0645\u06E1\u0633\u064E\u0629\u065E \u0633\u064E\u0627\u062F\u0650\u0633\u064F\u0647\u064F\u0645\u06E1 \u0643\u064E\u0644\u06E1\u0628\u064F\u0647\u064F\u0645\u06E1 \u0631\u064E\u062C\u06E1\u0645\u064E\u06E2\u0627 \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650\u06D6 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0633\u064E\u0628\u06E1\u0639\u064E\u0629\u065E \u0648\u064E\u062B\u064E\u0627\u0645\u0650\u0646\u064F\u0647\u064F\u0645\u06E1 \u0643\u064E\u0644\u06E1\u0628\u064F\u0647\u064F\u0645\u06E1\u06DA \u0642\u064F\u0644 \u0631\u0651\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0639\u0650\u062F\u0651\u064E\u062A\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u065E\u06D7 \u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0645\u064E\u0627\u0631\u0650 \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0631\u064E\u0627\u0653\u0621\u0657 \u0638\u064E\u0670\u0647\u0650\u0631\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0641\u06E1\u062A\u0650 \u0641\u0650\u064A\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 23, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u064F\u0648\u0644\u064E\u0646\u0651\u064E \u0644\u0650\u0634\u064E\u0627\u0652\u064A\u06E1\u0621\u064D \u0625\u0650\u0646\u0651\u0650\u064A \u0641\u064E\u0627\u0639\u0650\u0644\u065E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u063A\u064E\u062F\u064B\u0627" }, { id: 24, text: "\u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631 \u0631\u0651\u064E\u0628\u0651\u064E\u0643\u064E \u0625\u0650\u0630\u064E\u0627 \u0646\u064E\u0633\u0650\u064A\u062A\u064E \u0648\u064E\u0642\u064F\u0644\u06E1 \u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u064E\u0646\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u0650\u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064E \u0645\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0631\u064E\u0634\u064E\u062F\u0657\u0627" }, { id: 25, text: "\u0648\u064E\u0644\u064E\u0628\u0650\u062B\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0643\u064E\u0647\u06E1\u0641\u0650\u0647\u0650\u0645\u06E1 \u062B\u064E\u0644\u064E\u0670\u062B\u064E \u0645\u0650\u0627\u0652\u0626\u064E\u0629\u0656 \u0633\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0632\u06E1\u062F\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u062A\u0650\u0633\u06E1\u0639\u0657\u0627" }, { id: 26, text: "\u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0628\u0650\u062B\u064F\u0648\u0627\u0652\u06D6 \u0644\u064E\u0647\u064F\u06E5 \u063A\u064E\u064A\u06E1\u0628\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0623\u064E\u0628\u06E1\u0635\u0650\u0631\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u0633\u06E1\u0645\u0650\u0639\u06E1\u06DA \u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F \u0641\u0650\u064A \u062D\u064F\u0643\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 27, text: "\u0648\u064E\u0671\u062A\u06E1\u0644\u064F \u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0643\u0650\u062A\u064E\u0627\u0628\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0644\u064E\u0627 \u0645\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064E \u0644\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u064F\u0644\u06E1\u062A\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 28, text: "\u0648\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0646\u064E\u0641\u06E1\u0633\u064E\u0643\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u062F\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0634\u0650\u064A\u0651\u0650 \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u062C\u06E1\u0647\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062F\u064F \u0639\u064E\u064A\u06E1\u0646\u064E\u0627\u0643\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062A\u064F\u0631\u0650\u064A\u062F\u064F \u0632\u0650\u064A\u0646\u064E\u0629\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u0639\u06E1 \u0645\u064E\u0646\u06E1 \u0623\u064E\u063A\u06E1\u0641\u064E\u0644\u06E1\u0646\u064E\u0627 \u0642\u064E\u0644\u06E1\u0628\u064E\u0647\u064F\u06E5 \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650\u0646\u064E\u0627 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0647\u064E\u0648\u064E\u0649\u0670\u0647\u064F \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0645\u06E1\u0631\u064F\u0647\u064F\u06E5 \u0641\u064F\u0631\u064F\u0637\u0657\u0627" }, { id: 29, text: "\u0648\u064E\u0642\u064F\u0644\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0644\u06E1\u064A\u064F\u0624\u06E1\u0645\u0650\u0646 \u0648\u064E\u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0644\u06E1\u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0646\u064E\u0627\u0631\u064B\u0627 \u0623\u064E\u062D\u064E\u0627\u0637\u064E \u0628\u0650\u0647\u0650\u0645\u06E1 \u0633\u064F\u0631\u064E\u0627\u062F\u0650\u0642\u064F\u0647\u064E\u0627\u06DA \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u0650\u064A\u062B\u064F\u0648\u0627\u0652 \u064A\u064F\u063A\u064E\u0627\u062B\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653\u0621\u0656 \u0643\u064E\u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u0644\u0650 \u064A\u064E\u0634\u06E1\u0648\u0650\u064A \u0671\u0644\u06E1\u0648\u064F\u062C\u064F\u0648\u0647\u064E\u06DA \u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u0634\u0651\u064E\u0631\u064E\u0627\u0628\u064F \u0648\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0645\u064F\u0631\u06E1\u062A\u064E\u0641\u064E\u0642\u064B\u0627" }, { id: 30, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0627 \u0646\u064F\u0636\u0650\u064A\u0639\u064F \u0623\u064E\u062C\u06E1\u0631\u064E \u0645\u064E\u0646\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0639\u064E\u0645\u064E\u0644\u064B\u0627" }, { id: 31, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u064F \u0639\u064E\u062F\u06E1\u0646\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u064A\u064F\u062D\u064E\u0644\u0651\u064E\u0648\u06E1\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0633\u064E\u0627\u0648\u0650\u0631\u064E \u0645\u0650\u0646 \u0630\u064E\u0647\u064E\u0628\u0656 \u0648\u064E\u064A\u064E\u0644\u06E1\u0628\u064E\u0633\u064F\u0648\u0646\u064E \u062B\u0650\u064A\u064E\u0627\u0628\u064B\u0627 \u062E\u064F\u0636\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646 \u0633\u064F\u0646\u062F\u064F\u0633\u0656 \u0648\u064E\u0625\u0650\u0633\u06E1\u062A\u064E\u0628\u06E1\u0631\u064E\u0642\u0656 \u0645\u0651\u064F\u062A\u0651\u064E\u0643\u0650\u0640\u0654\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0643\u0650\u06DA \u0646\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u062B\u0651\u064E\u0648\u064E\u0627\u0628\u064F \u0648\u064E\u062D\u064E\u0633\u064F\u0646\u064E\u062A\u06E1 \u0645\u064F\u0631\u06E1\u062A\u064E\u0641\u064E\u0642\u0657\u0627" }, { id: 32, text: "\u06DE\u0648\u064E\u0671\u0636\u06E1\u0631\u0650\u0628\u06E1 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u062B\u064E\u0644\u0657\u0627 \u0631\u0651\u064E\u062C\u064F\u0644\u064E\u064A\u06E1\u0646\u0650 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0623\u064E\u062D\u064E\u062F\u0650\u0647\u0650\u0645\u064E\u0627 \u062C\u064E\u0646\u0651\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0646\u064E\u0670\u0628\u0656 \u0648\u064E\u062D\u064E\u0641\u064E\u0641\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064E\u0627 \u0628\u0650\u0646\u064E\u062E\u06E1\u0644\u0656 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0632\u064E\u0631\u06E1\u0639\u0657\u0627" }, { id: 33, text: "\u0643\u0650\u0644\u06E1\u062A\u064E\u0627 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0621\u064E\u0627\u062A\u064E\u062A\u06E1 \u0623\u064F\u0643\u064F\u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0638\u06E1\u0644\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06DA \u0648\u064E\u0641\u064E\u062C\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u062E\u0650\u0644\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u064E\u0627 \u0646\u064E\u0647\u064E\u0631\u0657\u0627" }, { id: 34, text: "\u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u062B\u064E\u0645\u064E\u0631\u065E \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0635\u064E\u0670\u062D\u0650\u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064F\u062D\u064E\u0627\u0648\u0650\u0631\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F \u0645\u0650\u0646\u0643\u064E \u0645\u064E\u0627\u0644\u0657\u0627 \u0648\u064E\u0623\u064E\u0639\u064E\u0632\u0651\u064F \u0646\u064E\u0641\u064E\u0631\u0657\u0627" }, { id: 35, text: "\u0648\u064E\u062F\u064E\u062E\u064E\u0644\u064E \u062C\u064E\u0646\u0651\u064E\u062A\u064E\u0647\u064F\u06E5 \u0648\u064E\u0647\u064F\u0648\u064E \u0638\u064E\u0627\u0644\u0650\u0645\u065E \u0644\u0651\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0638\u064F\u0646\u0651\u064F \u0623\u064E\u0646 \u062A\u064E\u0628\u0650\u064A\u062F\u064E \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627" }, { id: 36, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0638\u064F\u0646\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0631\u0651\u064F\u062F\u0650\u062F\u062A\u0651\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u0623\u064E\u062C\u0650\u062F\u064E\u0646\u0651\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u0645\u064F\u0646\u0642\u064E\u0644\u064E\u0628\u0657\u0627" }, { id: 37, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u06E5 \u0635\u064E\u0627\u062D\u0650\u0628\u064F\u0647\u064F\u06E5 \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064F\u062D\u064E\u0627\u0648\u0650\u0631\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u0643\u064E\u0641\u064E\u0631\u06E1\u062A\u064E \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064E \u0645\u0650\u0646 \u062A\u064F\u0631\u064E\u0627\u0628\u0656 \u062B\u064F\u0645\u0651\u064E \u0645\u0650\u0646 \u0646\u0651\u064F\u0637\u06E1\u0641\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u0633\u064E\u0648\u0651\u064E\u0649\u0670\u0643\u064E \u0631\u064E\u062C\u064F\u0644\u0657\u0627" }, { id: 38, text: "\u0644\u0651\u064E\u0640\u0670\u0643\u0650\u0646\u0651\u064E\u0627\u06E0 \u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064F\u0634\u06E1\u0631\u0650\u0643\u064F \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 39, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0625\u0650\u0630\u06E1 \u062F\u064E\u062E\u064E\u0644\u06E1\u062A\u064E \u062C\u064E\u0646\u0651\u064E\u062A\u064E\u0643\u064E \u0642\u064F\u0644\u06E1\u062A\u064E \u0645\u064E\u0627 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u0642\u064F\u0648\u0651\u064E\u0629\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646 \u062A\u064E\u0631\u064E\u0646\u0650 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0623\u064E\u0642\u064E\u0644\u0651\u064E \u0645\u0650\u0646\u0643\u064E \u0645\u064E\u0627\u0644\u0657\u0627 \u0648\u064E\u0648\u064E\u0644\u064E\u062F\u0657\u0627" }, { id: 40, text: "\u0641\u064E\u0639\u064E\u0633\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u0646 \u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u064E\u0646\u0650 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646 \u062C\u064E\u0646\u0651\u064E\u062A\u0650\u0643\u064E \u0648\u064E\u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u062D\u064F\u0633\u06E1\u0628\u064E\u0627\u0646\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0641\u064E\u062A\u064F\u0635\u06E1\u0628\u0650\u062D\u064E \u0635\u064E\u0639\u0650\u064A\u062F\u0657\u0627 \u0632\u064E\u0644\u064E\u0642\u064B\u0627" }, { id: 41, text: "\u0623\u064E\u0648\u06E1 \u064A\u064F\u0635\u06E1\u0628\u0650\u062D\u064E \u0645\u064E\u0627\u0653\u0624\u064F\u0647\u064E\u0627 \u063A\u064E\u0648\u06E1\u0631\u0657\u0627 \u0641\u064E\u0644\u064E\u0646 \u062A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064E \u0644\u064E\u0647\u064F\u06E5 \u0637\u064E\u0644\u064E\u0628\u0657\u0627" }, { id: 42, text: "\u0648\u064E\u0623\u064F\u062D\u0650\u064A\u0637\u064E \u0628\u0650\u062B\u064E\u0645\u064E\u0631\u0650\u0647\u0650\u06E6 \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064E \u064A\u064F\u0642\u064E\u0644\u0651\u0650\u0628\u064F \u0643\u064E\u0641\u0651\u064E\u064A\u06E1\u0647\u0650 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0647\u0650\u064A\u064E \u062E\u064E\u0627\u0648\u0650\u064A\u064E\u0629\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064F\u0631\u064F\u0648\u0634\u0650\u0647\u064E\u0627 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0644\u064E\u0645\u06E1 \u0623\u064F\u0634\u06E1\u0631\u0650\u0643\u06E1 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 43, text: "\u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0641\u0650\u0626\u064E\u0629\u065E \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u064F\u0646\u062A\u064E\u0635\u0650\u0631\u064B\u0627" }, { id: 44, text: "\u0647\u064F\u0646\u064E\u0627\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0648\u064E\u0644\u064E\u0670\u064A\u064E\u0629\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u062B\u064E\u0648\u064E\u0627\u0628\u0657\u0627 \u0648\u064E\u062E\u064E\u064A\u06E1\u0631\u064C \u0639\u064F\u0642\u06E1\u0628\u0657\u0627" }, { id: 45, text: "\u0648\u064E\u0671\u0636\u06E1\u0631\u0650\u0628\u06E1 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u062B\u064E\u0644\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0643\u064E\u0645\u064E\u0627\u0653\u0621\u064D \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0641\u064E\u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0637\u064E \u0628\u0650\u0647\u0650\u06E6 \u0646\u064E\u0628\u064E\u0627\u062A\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064E \u0647\u064E\u0634\u0650\u064A\u0645\u0657\u0627 \u062A\u064E\u0630\u06E1\u0631\u064F\u0648\u0647\u064F \u0671\u0644\u0631\u0651\u0650\u064A\u064E\u0670\u062D\u064F\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u064F\u0642\u06E1\u062A\u064E\u062F\u0650\u0631\u064B\u0627" }, { id: 46, text: "\u0671\u0644\u06E1\u0645\u064E\u0627\u0644\u064F \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0646\u064F\u0648\u0646\u064E \u0632\u0650\u064A\u0646\u064E\u0629\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0670\u0642\u0650\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u064F \u062E\u064E\u064A\u06E1\u0631\u064C \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u062B\u064E\u0648\u064E\u0627\u0628\u0657\u0627 \u0648\u064E\u062E\u064E\u064A\u06E1\u0631\u064C \u0623\u064E\u0645\u064E\u0644\u0657\u0627" }, { id: 47, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064F\u0633\u064E\u064A\u0651\u0650\u0631\u064F \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064E \u0648\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u064E\u0627\u0631\u0650\u0632\u064E\u0629\u0657 \u0648\u064E\u062D\u064E\u0634\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0645\u06E1 \u0646\u064F\u063A\u064E\u0627\u062F\u0650\u0631\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 48, text: "\u0648\u064E\u0639\u064F\u0631\u0650\u0636\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0635\u064E\u0641\u0651\u0657\u0627 \u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E\u0627 \u0643\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u0650\u06ED\u06DA \u0628\u064E\u0644\u06E1 \u0632\u064E\u0639\u064E\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0644\u0651\u064E\u0646 \u0646\u0651\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0648\u06E1\u0639\u0650\u062F\u0657\u0627" }, { id: 49, text: "\u0648\u064E\u0648\u064F\u0636\u0650\u0639\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064F \u0641\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u064F\u0634\u06E1\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u064A\u064E\u0670\u0648\u064E\u064A\u06E1\u0644\u064E\u062A\u064E\u0646\u064E\u0627 \u0645\u064E\u0627\u0644\u0650 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0627 \u064A\u064F\u063A\u064E\u0627\u062F\u0650\u0631\u064F \u0635\u064E\u063A\u0650\u064A\u0631\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u064E\u0629\u064B \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u062D\u06E1\u0635\u064E\u0649\u0670\u0647\u064E\u0627\u06DA \u0648\u064E\u0648\u064E\u062C\u064E\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u062D\u064E\u0627\u0636\u0650\u0631\u0657\u0627\u06D7 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0623\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 50, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0671\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652 \u0644\u0650\u0623\u0653\u062F\u064E\u0645\u064E \u0641\u064E\u0633\u064E\u062C\u064E\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064E \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0641\u064E\u0641\u064E\u0633\u064E\u0642\u064E \u0639\u064E\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u0653\u06D7 \u0623\u064E\u0641\u064E\u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u064A \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u064F\u06E2\u06DA \u0628\u0650\u0626\u06E1\u0633\u064E \u0644\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0628\u064E\u062F\u064E\u0644\u0657\u0627" }, { id: 51, text: "\u06DE\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0634\u06E1\u0647\u064E\u062F\u062A\u0651\u064F\u0647\u064F\u0645\u06E1 \u062E\u064E\u0644\u06E1\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u062E\u064E\u0644\u06E1\u0642\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F \u0645\u064F\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0671\u0644\u06E1\u0645\u064F\u0636\u0650\u0644\u0651\u0650\u064A\u0646\u064E \u0639\u064E\u0636\u064F\u062F\u0657\u0627" }, { id: 52, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0646\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0632\u064E\u0639\u064E\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u062F\u064E\u0639\u064E\u0648\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0648\u06E1\u0628\u0650\u0642\u0657\u0627" }, { id: 53, text: "\u0648\u064E\u0631\u064E\u0621\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E \u0641\u064E\u0638\u064E\u0646\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0648\u064E\u0627\u0642\u0650\u0639\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0645\u064E\u0635\u06E1\u0631\u0650\u0641\u0657\u0627" }, { id: 54, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0635\u064E\u0631\u0651\u064E\u0641\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u062B\u064E\u0644\u0656\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0634\u064E\u064A\u06E1\u0621\u0656 \u062C\u064E\u062F\u064E\u0644\u0657\u0627" }, { id: 55, text: "\u0648\u064E\u0645\u064E\u0627 \u0645\u064E\u0646\u064E\u0639\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0623\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0633\u064F\u0646\u0651\u064E\u0629\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E \u0623\u064E\u0648\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0642\u064F\u0628\u064F\u0644\u0657\u0627" }, { id: 56, text: "\u0648\u064E\u0645\u064E\u0627 \u0646\u064F\u0631\u06E1\u0633\u0650\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0645\u064F\u0646\u0630\u0650\u0631\u0650\u064A\u0646\u064E\u06DA \u0648\u064E\u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u0644\u0650\u064A\u064F\u062F\u06E1\u062D\u0650\u0636\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0630\u0650\u0631\u064F\u0648\u0627\u0652 \u0647\u064F\u0632\u064F\u0648\u0657\u0627" }, { id: 57, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646 \u0630\u064F\u0643\u0651\u0650\u0631\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0641\u064E\u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064E \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0646\u064E\u0633\u0650\u064A\u064E \u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u064A\u064E\u062F\u064E\u0627\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0643\u0650\u0646\u0651\u064E\u0629\u064B \u0623\u064E\u0646 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0647\u064F \u0648\u064E\u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0642\u06E1\u0631\u0657\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u062F\u06E1\u0639\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0641\u064E\u0644\u064E\u0646 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064B\u0627 \u0623\u064E\u0628\u064E\u062F\u0657\u0627" }, { id: 58, text: "\u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F \u0630\u064F\u0648 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u0650\u06D6 \u0644\u064E\u0648\u06E1 \u064A\u064F\u0624\u064E\u0627\u062E\u0650\u0630\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0639\u064E\u062C\u0651\u064E\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E\u06DA \u0628\u064E\u0644 \u0644\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0648\u06E1\u0639\u0650\u062F\u065E \u0644\u0651\u064E\u0646 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u064E\u0648\u06E1\u0626\u0650\u0644\u0657\u0627" }, { id: 59, text: "\u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0644\u064E\u0645\u0651\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0645\u064E\u0647\u06E1\u0644\u0650\u0643\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0648\u06E1\u0639\u0650\u062F\u0657\u0627" }, { id: 60, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0641\u064E\u062A\u064E\u0649\u0670\u0647\u064F \u0644\u064E\u0627\u0653 \u0623\u064E\u0628\u06E1\u0631\u064E\u062D\u064F \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0623\u064E\u0628\u06E1\u0644\u064F\u063A\u064E \u0645\u064E\u062C\u06E1\u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0645\u06E1\u0636\u0650\u064A\u064E \u062D\u064F\u0642\u064F\u0628\u0657\u0627" }, { id: 61, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E\u0627 \u0645\u064E\u062C\u06E1\u0645\u064E\u0639\u064E \u0628\u064E\u064A\u06E1\u0646\u0650\u0647\u0650\u0645\u064E\u0627 \u0646\u064E\u0633\u0650\u064A\u064E\u0627 \u062D\u064F\u0648\u062A\u064E\u0647\u064F\u0645\u064E\u0627 \u0641\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0633\u064E\u0631\u064E\u0628\u0657\u0627" }, { id: 62, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0648\u064E\u0632\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0641\u064E\u062A\u064E\u0649\u0670\u0647\u064F \u0621\u064E\u0627\u062A\u0650\u0646\u064E\u0627 \u063A\u064E\u062F\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0644\u064E\u0642\u064E\u062F\u06E1 \u0644\u064E\u0642\u0650\u064A\u0646\u064E\u0627 \u0645\u0650\u0646 \u0633\u064E\u0641\u064E\u0631\u0650\u0646\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627 \u0646\u064E\u0635\u064E\u0628\u0657\u0627" }, { id: 63, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E \u0625\u0650\u0630\u06E1 \u0623\u064E\u0648\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0635\u0651\u064E\u062E\u06E1\u0631\u064E\u0629\u0650 \u0641\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0646\u064E\u0633\u0650\u064A\u062A\u064F \u0671\u0644\u06E1\u062D\u064F\u0648\u062A\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0633\u064E\u0649\u0670\u0646\u0650\u064A\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0630\u06E1\u0643\u064F\u0631\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0639\u064E\u062C\u064E\u0628\u0657\u0627" }, { id: 64, text: "\u0642\u064E\u0627\u0644\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u0628\u06E1\u063A\u0650\u06DA \u0641\u064E\u0671\u0631\u06E1\u062A\u064E\u062F\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062B\u064E\u0627\u0631\u0650\u0647\u0650\u0645\u064E\u0627 \u0642\u064E\u0635\u064E\u0635\u0657\u0627" }, { id: 65, text: "\u0641\u064E\u0648\u064E\u062C\u064E\u062F\u064E\u0627 \u0639\u064E\u0628\u06E1\u062F\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0646\u064E\u0627 \u0648\u064E\u0639\u064E\u0644\u0651\u064E\u0645\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0651\u064E\u0627 \u0639\u0650\u0644\u06E1\u0645\u0657\u0627" }, { id: 66, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0647\u064E\u0644\u06E1 \u0623\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064E\u0646\u0650 \u0645\u0650\u0645\u0651\u064E\u0627 \u0639\u064F\u0644\u0651\u0650\u0645\u06E1\u062A\u064E \u0631\u064F\u0634\u06E1\u062F\u0657\u0627" }, { id: 67, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0646 \u062A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064E \u0645\u064E\u0639\u0650\u064A\u064E \u0635\u064E\u0628\u06E1\u0631\u0657\u0627" }, { id: 68, text: "\u0648\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064E\u0635\u06E1\u0628\u0650\u0631\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064F\u062D\u0650\u0637\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u062E\u064F\u0628\u06E1\u0631\u0657\u0627" }, { id: 69, text: "\u0642\u064E\u0627\u0644\u064E \u0633\u064E\u062A\u064E\u062C\u0650\u062F\u064F\u0646\u0650\u064A\u0653 \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0635\u064E\u0627\u0628\u0650\u0631\u0657\u0627 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0635\u0650\u064A \u0644\u064E\u0643\u064E \u0623\u064E\u0645\u06E1\u0631\u0657\u0627" }, { id: 70, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0625\u0650\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u06E1\u062A\u064E\u0646\u0650\u064A \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u06E1\u0646\u0650\u064A \u0639\u064E\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0623\u064F\u062D\u06E1\u062F\u0650\u062B\u064E \u0644\u064E\u0643\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0630\u0650\u0643\u06E1\u0631\u0657\u0627" }, { id: 71, text: "\u0641\u064E\u0671\u0646\u0637\u064E\u0644\u064E\u0642\u064E\u0627 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0643\u0650\u0628\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0641\u0650\u064A\u0646\u064E\u0629\u0650 \u062E\u064E\u0631\u064E\u0642\u064E\u0647\u064E\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u062E\u064E\u0631\u064E\u0642\u06E1\u062A\u064E\u0647\u064E\u0627 \u0644\u0650\u062A\u064F\u063A\u06E1\u0631\u0650\u0642\u064E \u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064E\u0627 \u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627 \u0625\u0650\u0645\u06E1\u0631\u0657\u0627" }, { id: 72, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0644\u064E\u0645\u06E1 \u0623\u064E\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0646 \u062A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064E \u0645\u064E\u0639\u0650\u064A\u064E \u0635\u064E\u0628\u06E1\u0631\u0657\u0627" }, { id: 73, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0627 \u062A\u064F\u0624\u064E\u0627\u062E\u0650\u0630\u06E1\u0646\u0650\u064A \u0628\u0650\u0645\u064E\u0627 \u0646\u064E\u0633\u0650\u064A\u062A\u064F \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0631\u06E1\u0647\u0650\u0642\u06E1\u0646\u0650\u064A \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u064A \u0639\u064F\u0633\u06E1\u0631\u0657\u0627" }, { id: 74, text: "\u0641\u064E\u0671\u0646\u0637\u064E\u0644\u064E\u0642\u064E\u0627 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0644\u064E\u0642\u0650\u064A\u064E\u0627 \u063A\u064F\u0644\u064E\u0670\u0645\u0657\u0627 \u0641\u064E\u0642\u064E\u062A\u064E\u0644\u064E\u0647\u064F\u06E5 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0642\u064E\u062A\u064E\u0644\u06E1\u062A\u064E \u0646\u064E\u0641\u06E1\u0633\u0657\u0627 \u0632\u064E\u0643\u0650\u064A\u0651\u064E\u0629\u064E\u06E2 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0646\u064E\u0641\u06E1\u0633\u0656 \u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0646\u0651\u064F\u0643\u06E1\u0631\u0657\u0627" }, { id: 75, text: "\u06DE\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0644\u064E\u0645\u06E1 \u0623\u064E\u0642\u064F\u0644 \u0644\u0651\u064E\u0643\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0646 \u062A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064E \u0645\u064E\u0639\u0650\u064A\u064E \u0635\u064E\u0628\u06E1\u0631\u0657\u0627" }, { id: 76, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064F\u0643\u064E \u0639\u064E\u0646 \u0634\u064E\u064A\u06E1\u0621\u0650\u06ED \u0628\u064E\u0639\u06E1\u062F\u064E\u0647\u064E\u0627 \u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0635\u064E\u0670\u062D\u0650\u0628\u06E1\u0646\u0650\u064A\u06D6 \u0642\u064E\u062F\u06E1 \u0628\u064E\u0644\u064E\u063A\u06E1\u062A\u064E \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0651\u0650\u064A \u0639\u064F\u0630\u06E1\u0631\u0657\u0627" }, { id: 77, text: "\u0641\u064E\u0671\u0646\u0637\u064E\u0644\u064E\u0642\u064E\u0627 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u064A\u064E\u0627\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0671\u0633\u06E1\u062A\u064E\u0637\u06E1\u0639\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064E\u0627 \u0641\u064E\u0623\u064E\u0628\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646 \u064A\u064F\u0636\u064E\u064A\u0651\u0650\u0641\u064F\u0648\u0647\u064F\u0645\u064E\u0627 \u0641\u064E\u0648\u064E\u062C\u064E\u062F\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u062C\u0650\u062F\u064E\u0627\u0631\u0657\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u064A\u064E\u0646\u0642\u064E\u0636\u0651\u064E \u0641\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064E\u0647\u064F\u06E5\u06D6 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0648\u06E1 \u0634\u0650\u0626\u06E1\u062A\u064E \u0644\u064E\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u062C\u06E1\u0631\u0657\u0627" }, { id: 78, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u0650\u0631\u064E\u0627\u0642\u064F \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u0650\u0643\u064E\u06DA \u0633\u064E\u0623\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064E \u0628\u0650\u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u0650 \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u0639 \u0639\u0651\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0635\u064E\u0628\u06E1\u0631\u064B\u0627" }, { id: 79, text: "\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0641\u0650\u064A\u0646\u064E\u0629\u064F \u0641\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0644\u0650\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u064E \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0641\u064E\u0623\u064E\u0631\u064E\u062F\u062A\u0651\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0639\u0650\u064A\u0628\u064E\u0647\u064E\u0627 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0644\u0650\u0643\u065E \u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F \u0643\u064F\u0644\u0651\u064E \u0633\u064E\u0641\u0650\u064A\u0646\u064E\u0629\u064D \u063A\u064E\u0635\u06E1\u0628\u0657\u0627" }, { id: 80, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u06E1\u063A\u064F\u0644\u064E\u0670\u0645\u064F \u0641\u064E\u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0628\u064E\u0648\u064E\u0627\u0647\u064F \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u062E\u064E\u0634\u0650\u064A\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u0631\u06E1\u0647\u0650\u0642\u064E\u0647\u064F\u0645\u064E\u0627 \u0637\u064F\u063A\u06E1\u064A\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0643\u064F\u0641\u06E1\u0631\u0657\u0627" }, { id: 81, text: "\u0641\u064E\u0623\u064E\u0631\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u0628\u06E1\u062F\u0650\u0644\u064E\u0647\u064F\u0645\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u064E\u0627 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0632\u064E\u0643\u064E\u0648\u0670\u0629\u0657 \u0648\u064E\u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064E \u0631\u064F\u062D\u06E1\u0645\u0657\u0627" }, { id: 82, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u06E1\u062C\u0650\u062F\u064E\u0627\u0631\u064F \u0641\u064E\u0643\u064E\u0627\u0646\u064E \u0644\u0650\u063A\u064F\u0644\u064E\u0670\u0645\u064E\u064A\u06E1\u0646\u0650 \u064A\u064E\u062A\u0650\u064A\u0645\u064E\u064A\u06E1\u0646\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u062A\u064E\u062D\u06E1\u062A\u064E\u0647\u064F\u06E5 \u0643\u064E\u0646\u0632\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0628\u064F\u0648\u0647\u064F\u0645\u064E\u0627 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0623\u064E\u0646 \u064A\u064E\u0628\u06E1\u0644\u064F\u063A\u064E\u0627\u0653 \u0623\u064E\u0634\u064F\u062F\u0651\u064E\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0631\u0650\u062C\u064E\u0627 \u0643\u064E\u0646\u0632\u064E\u0647\u064F\u0645\u064E\u0627 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E\u06DA \u0648\u064E\u0645\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u06E1\u062A\u064F\u0647\u064F\u06E5 \u0639\u064E\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u064A\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062A\u064E\u0623\u06E1\u0648\u0650\u064A\u0644\u064F \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0633\u06E1\u0637\u0650\u0639 \u0639\u0651\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0635\u064E\u0628\u06E1\u0631\u0657\u0627" }, { id: 83, text: "\u0648\u064E\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646 \u0630\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650\u06D6 \u0642\u064F\u0644\u06E1 \u0633\u064E\u0623\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0630\u0650\u0643\u06E1\u0631\u064B\u0627" }, { id: 84, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064E\u0643\u0651\u064E\u0646\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0633\u064E\u0628\u064E\u0628\u0657\u0627" }, { id: 85, text: "\u0641\u064E\u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u064E \u0633\u064E\u0628\u064E\u0628\u064B\u0627" }, { id: 86, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E \u0645\u064E\u063A\u06E1\u0631\u0650\u0628\u064E \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u0650 \u0648\u064E\u062C\u064E\u062F\u064E\u0647\u064E\u0627 \u062A\u064E\u063A\u06E1\u0631\u064F\u0628\u064F \u0641\u0650\u064A \u0639\u064E\u064A\u06E1\u0646\u064D \u062D\u064E\u0645\u0650\u0626\u064E\u0629\u0656 \u0648\u064E\u0648\u064E\u062C\u064E\u062F\u064E \u0639\u0650\u0646\u062F\u064E\u0647\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627\u06D6 \u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u064A\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650 \u0625\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E \u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u062D\u064F\u0633\u06E1\u0646\u0657\u0627" }, { id: 87, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646 \u0638\u064E\u0644\u064E\u0645\u064E \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u0646\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0631\u064E\u062F\u0651\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0641\u064E\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0647\u064F\u06E5 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0646\u0651\u064F\u0643\u06E1\u0631\u0657\u0627" }, { id: 88, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0644\u064E\u0647\u064F\u06E5 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064B \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670\u06D6 \u0648\u064E\u0633\u064E\u0646\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u0646\u064E\u0627 \u064A\u064F\u0633\u06E1\u0631\u0657\u0627" }, { id: 89, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u064E \u0633\u064E\u0628\u064E\u0628\u064B\u0627" }, { id: 90, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E \u0645\u064E\u0637\u06E1\u0644\u0650\u0639\u064E \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u0650 \u0648\u064E\u062C\u064E\u062F\u064E\u0647\u064E\u0627 \u062A\u064E\u0637\u06E1\u0644\u064F\u0639\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0656 \u0644\u0651\u064E\u0645\u06E1 \u0646\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u064E\u0627 \u0633\u0650\u062A\u06E1\u0631\u0657\u0627" }, { id: 91, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u062D\u064E\u0637\u06E1\u0646\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u062E\u064F\u0628\u06E1\u0631\u0657\u0627" }, { id: 92, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u064E \u0633\u064E\u0628\u064E\u0628\u064B\u0627" }, { id: 93, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u062F\u0651\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u062C\u064E\u062F\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u0645\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0644\u0651\u064E\u0627 \u064A\u064E\u0643\u064E\u0627\u062F\u064F\u0648\u0646\u064E \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E \u0642\u064E\u0648\u06E1\u0644\u0657\u0627" }, { id: 94, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650 \u0625\u0650\u0646\u0651\u064E \u064A\u064E\u0623\u06E1\u062C\u064F\u0648\u062C\u064E \u0648\u064E\u0645\u064E\u0623\u06E1\u062C\u064F\u0648\u062C\u064E \u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0644\u064E\u0643\u064E \u062E\u064E\u0631\u06E1\u062C\u064B\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u062F\u0651\u0657\u0627" }, { id: 95, text: "\u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0627 \u0645\u064E\u0643\u0651\u064E\u0646\u0651\u0650\u064A \u0641\u0650\u064A\u0647\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u062E\u064E\u064A\u06E1\u0631\u065E \u0641\u064E\u0623\u064E\u0639\u0650\u064A\u0646\u064F\u0648\u0646\u0650\u064A \u0628\u0650\u0642\u064F\u0648\u0651\u064E\u0629\u064D \u0623\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u062F\u06E1\u0645\u064B\u0627" }, { id: 96, text: "\u0621\u064E\u0627\u062A\u064F\u0648\u0646\u0650\u064A \u0632\u064F\u0628\u064E\u0631\u064E \u0671\u0644\u06E1\u062D\u064E\u062F\u0650\u064A\u062F\u0650\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u0627\u0648\u064E\u0649\u0670 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u062F\u064E\u0641\u064E\u064A\u06E1\u0646\u0650 \u0642\u064E\u0627\u0644\u064E \u0671\u0646\u0641\u064F\u062E\u064F\u0648\u0627\u0652\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u06E5 \u0646\u064E\u0627\u0631\u0657\u0627 \u0642\u064E\u0627\u0644\u064E \u0621\u064E\u0627\u062A\u064F\u0648\u0646\u0650\u064A\u0653 \u0623\u064F\u0641\u06E1\u0631\u0650\u063A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0642\u0650\u0637\u06E1\u0631\u0657\u0627" }, { id: 97, text: "\u0641\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u0637\u064E\u0670\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064E\u0638\u06E1\u0647\u064E\u0631\u064F\u0648\u0647\u064F \u0648\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0670\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0646\u064E\u0642\u06E1\u0628\u0657\u0627" }, { id: 98, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u064A\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0639\u06E1\u062F\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u06E5 \u062F\u064E\u0643\u0651\u064E\u0627\u0653\u0621\u064E\u06D6 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0648\u064E\u0639\u06E1\u062F\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u062D\u064E\u0642\u0651\u0657\u0627" }, { id: 99, text: "\u06DE\u0648\u064E\u062A\u064E\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064E\u0645\u064F\u0648\u062C\u064F \u0641\u0650\u064A \u0628\u064E\u0639\u06E1\u0636\u0656\u06D6 \u0648\u064E\u0646\u064F\u0641\u0650\u062E\u064E \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u0648\u0631\u0650 \u0641\u064E\u062C\u064E\u0645\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0645\u06E1\u0639\u0657\u0627" }, { id: 100, text: "\u0648\u064E\u0639\u064E\u0631\u064E\u0636\u06E1\u0646\u064E\u0627 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0631\u06E1\u0636\u064B\u0627" }, { id: 101, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u063A\u0650\u0637\u064E\u0627\u0653\u0621\u064D \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650\u064A \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0633\u064E\u0645\u06E1\u0639\u064B\u0627" }, { id: 102, text: "\u0623\u064E\u0641\u064E\u062D\u064E\u0633\u0650\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u064A\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0646\u064F\u0632\u064F\u0644\u0657\u0627" }, { id: 103, text: "\u0642\u064F\u0644\u06E1 \u0647\u064E\u0644\u06E1 \u0646\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u062E\u06E1\u0633\u064E\u0631\u0650\u064A\u0646\u064E \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064B\u0627" }, { id: 104, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0636\u064E\u0644\u0651\u064E \u0633\u064E\u0639\u06E1\u064A\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u062D\u06E1\u0633\u0650\u0646\u064F\u0648\u0646\u064E \u0635\u064F\u0646\u06E1\u0639\u064B\u0627" }, { id: 105, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u0650\u0642\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u06E6 \u0641\u064E\u062D\u064E\u0628\u0650\u0637\u064E\u062A\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u0646\u064F\u0642\u0650\u064A\u0645\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0648\u064E\u0632\u06E1\u0646\u0657\u0627" }, { id: 106, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u064A \u0647\u064F\u0632\u064F\u0648\u064B\u0627" }, { id: 107, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u064F \u0671\u0644\u06E1\u0641\u0650\u0631\u06E1\u062F\u064E\u0648\u06E1\u0633\u0650 \u0646\u064F\u0632\u064F\u0644\u064B\u0627" }, { id: 108, text: "\u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u062D\u0650\u0648\u064E\u0644\u0657\u0627" }, { id: 109, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064F \u0645\u0650\u062F\u064E\u0627\u062F\u0657\u0627 \u0644\u0651\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u0646\u064E\u0641\u0650\u062F\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064F \u0642\u064E\u0628\u06E1\u0644\u064E \u0623\u064E\u0646 \u062A\u064E\u0646\u0641\u064E\u062F\u064E \u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0644\u064E\u0648\u06E1 \u062C\u0650\u0626\u06E1\u0646\u064E\u0627 \u0628\u0650\u0645\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0645\u064E\u062F\u064E\u062F\u0657\u0627" }, { id: 110, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0643\u064F\u0645\u06E1 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E\u06D6 \u0641\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0627\u0652 \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0641\u064E\u0644\u06E1\u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0639\u064E\u0645\u064E\u0644\u0657\u0627 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u06E1 \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u064E\u0629\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u062D\u064E\u062F\u064E\u06E2\u0627" }] }, { id: 19, name: "\u0645\u0631\u064A\u0645", transliteration: "Maryam", type: "meccan", total_verses: 98, verses: [{ id: 1, text: "\u0643\u0653\u0647\u064A\u0639\u0653\u0635\u0653" }, { id: 2, text: "\u0630\u0650\u0643\u06E1\u0631\u064F \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0639\u064E\u0628\u06E1\u062F\u064E\u0647\u064F\u06E5 \u0632\u064E\u0643\u064E\u0631\u0650\u064A\u0651\u064E\u0627\u0653" }, { id: 3, text: "\u0625\u0650\u0630\u06E1 \u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u0646\u0650\u062F\u064E\u0627\u0653\u0621\u064B \u062E\u064E\u0641\u0650\u064A\u0651\u0657\u0627" }, { id: 4, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0648\u064E\u0647\u064E\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0638\u06E1\u0645\u064F \u0645\u0650\u0646\u0651\u0650\u064A \u0648\u064E\u0671\u0634\u06E1\u062A\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0631\u0651\u064E\u0623\u06E1\u0633\u064F \u0634\u064E\u064A\u06E1\u0628\u0657\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u0623\u064E\u0643\u064F\u0646\u06E2 \u0628\u0650\u062F\u064F\u0639\u064E\u0627\u0653\u0626\u0650\u0643\u064E \u0631\u064E\u0628\u0651\u0650 \u0634\u064E\u0642\u0650\u064A\u0651\u0657\u0627" }, { id: 5, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u062E\u0650\u0641\u06E1\u062A\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u064E\u0670\u0644\u0650\u064A\u064E \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u0650\u064A \u0648\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u0650 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u0650\u064A \u0639\u064E\u0627\u0642\u0650\u0631\u0657\u0627 \u0641\u064E\u0647\u064E\u0628\u06E1 \u0644\u0650\u064A \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0643\u064E \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627" }, { id: 6, text: "\u064A\u064E\u0631\u0650\u062B\u064F\u0646\u0650\u064A \u0648\u064E\u064A\u064E\u0631\u0650\u062B\u064F \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u0644\u0650 \u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E\u06D6 \u0648\u064E\u0671\u062C\u06E1\u0639\u064E\u0644\u06E1\u0647\u064F \u0631\u064E\u0628\u0651\u0650 \u0631\u064E\u0636\u0650\u064A\u0651\u0657\u0627" }, { id: 7, text: "\u064A\u064E\u0670\u0632\u064E\u0643\u064E\u0631\u0650\u064A\u0651\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064F\u0643\u064E \u0628\u0650\u063A\u064F\u0644\u064E\u0670\u0645\u064D \u0671\u0633\u06E1\u0645\u064F\u0647\u064F\u06E5 \u064A\u064E\u062D\u06E1\u064A\u064E\u0649\u0670 \u0644\u064E\u0645\u06E1 \u0646\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0633\u064E\u0645\u0650\u064A\u0651\u0657\u0627" }, { id: 8, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u0650\u064A \u063A\u064F\u0644\u064E\u0670\u0645\u065E \u0648\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u0650 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u0650\u064A \u0639\u064E\u0627\u0642\u0650\u0631\u0657\u0627 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0628\u064E\u0644\u064E\u063A\u06E1\u062A\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u0628\u064E\u0631\u0650 \u0639\u0650\u062A\u0650\u064A\u0651\u0657\u0627" }, { id: 9, text: "\u0642\u064E\u0627\u0644\u064E \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0647\u064E\u064A\u0651\u0650\u0646\u065E \u0648\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064F\u0643\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627" }, { id: 10, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u0657\u06D6 \u0642\u064E\u0627\u0644\u064E \u0621\u064E\u0627\u064A\u064E\u062A\u064F\u0643\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u062B\u064E\u0644\u064E\u0670\u062B\u064E \u0644\u064E\u064A\u064E\u0627\u0644\u0656 \u0633\u064E\u0648\u0650\u064A\u0651\u0657\u0627" }, { id: 11, text: "\u0641\u064E\u062E\u064E\u0631\u064E\u062C\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u0650\u062D\u06E1\u0631\u064E\u0627\u0628\u0650 \u0641\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646 \u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0627\u0652 \u0628\u064F\u0643\u06E1\u0631\u064E\u0629\u0657 \u0648\u064E\u0639\u064E\u0634\u0650\u064A\u0651\u0657\u0627" }, { id: 12, text: "\u064A\u064E\u0670\u064A\u064E\u062D\u06E1\u064A\u064E\u0649\u0670 \u062E\u064F\u0630\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0628\u0650\u0642\u064F\u0648\u0651\u064E\u0629\u0656\u06D6 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064E \u0635\u064E\u0628\u0650\u064A\u0651\u0657\u0627" }, { id: 13, text: "\u0648\u064E\u062D\u064E\u0646\u064E\u0627\u0646\u0657\u0627 \u0645\u0651\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0651\u064E\u0627 \u0648\u064E\u0632\u064E\u0643\u064E\u0648\u0670\u0629\u0657\u06D6 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u062A\u064E\u0642\u0650\u064A\u0651\u0657\u0627" }, { id: 14, text: "\u0648\u064E\u0628\u064E\u0631\u0651\u064E\u06E2\u0627 \u0628\u0650\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u062C\u064E\u0628\u0651\u064E\u0627\u0631\u064B\u0627 \u0639\u064E\u0635\u0650\u064A\u0651\u0657\u0627" }, { id: 15, text: "\u0648\u064E\u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E \u0648\u064F\u0644\u0650\u062F\u064E \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0645\u064F\u0648\u062A\u064F \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F \u062D\u064E\u064A\u0651\u0657\u0627" }, { id: 16, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0625\u0650\u0630\u0650 \u0671\u0646\u062A\u064E\u0628\u064E\u0630\u064E\u062A\u06E1 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u064E\u0627 \u0645\u064E\u0643\u064E\u0627\u0646\u0657\u0627 \u0634\u064E\u0631\u06E1\u0642\u0650\u064A\u0651\u0657\u0627" }, { id: 17, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E\u062A\u06E1 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u0645\u06E1 \u062D\u0650\u062C\u064E\u0627\u0628\u0657\u0627 \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0631\u064F\u0648\u062D\u064E\u0646\u064E\u0627 \u0641\u064E\u062A\u064E\u0645\u064E\u062B\u0651\u064E\u0644\u064E \u0644\u064E\u0647\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u0657\u0627 \u0633\u064E\u0648\u0650\u064A\u0651\u0657\u0627" }, { id: 18, text: "\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u064F\u0648\u0630\u064F \u0628\u0650\u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0645\u0650\u0646\u0643\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u062A\u064E\u0642\u0650\u064A\u0651\u0657\u0627" }, { id: 19, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0631\u064E\u0633\u064F\u0648\u0644\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u0650 \u0644\u0650\u0623\u064E\u0647\u064E\u0628\u064E \u0644\u064E\u0643\u0650 \u063A\u064F\u0644\u064E\u0670\u0645\u0657\u0627 \u0632\u064E\u0643\u0650\u064A\u0651\u0657\u0627" }, { id: 20, text: "\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u0650\u064A \u063A\u064F\u0644\u064E\u0670\u0645\u065E \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0645\u06E1\u0633\u064E\u0633\u06E1\u0646\u0650\u064A \u0628\u064E\u0634\u064E\u0631\u065E \u0648\u064E\u0644\u064E\u0645\u06E1 \u0623\u064E\u0643\u064F \u0628\u064E\u063A\u0650\u064A\u0651\u0657\u0627" }, { id: 21, text: "\u0642\u064E\u0627\u0644\u064E \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u0650 \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u0650 \u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0647\u064E\u064A\u0651\u0650\u0646\u065E\u06D6 \u0648\u064E\u0644\u0650\u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064E\u0647\u064F\u06E5\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u0651\u064E\u0627\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0645\u06E1\u0631\u0657\u0627 \u0645\u0651\u064E\u0642\u06E1\u0636\u0650\u064A\u0651\u0657\u0627" }, { id: 22, text: "\u06DE\u0641\u064E\u062D\u064E\u0645\u064E\u0644\u064E\u062A\u06E1\u0647\u064F \u0641\u064E\u0671\u0646\u062A\u064E\u0628\u064E\u0630\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0643\u064E\u0627\u0646\u0657\u0627 \u0642\u064E\u0635\u0650\u064A\u0651\u0657\u0627" }, { id: 23, text: "\u0641\u064E\u0623\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u062E\u064E\u0627\u0636\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u062C\u0650\u0630\u06E1\u0639\u0650 \u0671\u0644\u0646\u0651\u064E\u062E\u06E1\u0644\u064E\u0629\u0650 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0645\u0650\u062A\u0651\u064F \u0642\u064E\u0628\u06E1\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0648\u064E\u0643\u064F\u0646\u062A\u064F \u0646\u064E\u0633\u06E1\u064A\u0657\u0627 \u0645\u0651\u064E\u0646\u0633\u0650\u064A\u0651\u0657\u0627" }, { id: 24, text: "\u0641\u064E\u0646\u064E\u0627\u062F\u064E\u0649\u0670\u0647\u064E\u0627 \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u0650\u064A \u0642\u064E\u062F\u06E1 \u062C\u064E\u0639\u064E\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u0650 \u062A\u064E\u062D\u06E1\u062A\u064E\u0643\u0650 \u0633\u064E\u0631\u0650\u064A\u0651\u0657\u0627" }, { id: 25, text: "\u0648\u064E\u0647\u064F\u0632\u0651\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u0650 \u0628\u0650\u062C\u0650\u0630\u06E1\u0639\u0650 \u0671\u0644\u0646\u0651\u064E\u062E\u06E1\u0644\u064E\u0629\u0650 \u062A\u064F\u0633\u064E\u0670\u0642\u0650\u0637\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u0650 \u0631\u064F\u0637\u064E\u0628\u0657\u0627 \u062C\u064E\u0646\u0650\u064A\u0651\u0657\u0627" }, { id: 26, text: "\u0641\u064E\u0643\u064F\u0644\u0650\u064A \u0648\u064E\u0671\u0634\u06E1\u0631\u064E\u0628\u0650\u064A \u0648\u064E\u0642\u064E\u0631\u0651\u0650\u064A \u0639\u064E\u064A\u06E1\u0646\u0657\u0627\u06D6 \u0641\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u064A\u0650\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u0634\u064E\u0631\u0650 \u0623\u064E\u062D\u064E\u062F\u0657\u0627 \u0641\u064E\u0642\u064F\u0648\u0644\u0650\u064A\u0653 \u0625\u0650\u0646\u0651\u0650\u064A \u0646\u064E\u0630\u064E\u0631\u06E1\u062A\u064F \u0644\u0650\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0635\u064E\u0648\u06E1\u0645\u0657\u0627 \u0641\u064E\u0644\u064E\u0646\u06E1 \u0623\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0625\u0650\u0646\u0633\u0650\u064A\u0651\u0657\u0627" }, { id: 27, text: "\u0641\u064E\u0623\u064E\u062A\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064E\u0627 \u062A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F\u0647\u064F\u06E5\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064F \u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u062A\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0641\u064E\u0631\u0650\u064A\u0651\u0657\u0627" }, { id: 28, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064F\u062E\u06E1\u062A\u064E \u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0628\u064F\u0648\u0643\u0650 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E \u0633\u064E\u0648\u06E1\u0621\u0656 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0623\u064F\u0645\u0651\u064F\u0643\u0650 \u0628\u064E\u063A\u0650\u064A\u0651\u0657\u0627" }, { id: 29, text: "\u0641\u064E\u0623\u064E\u0634\u064E\u0627\u0631\u064E\u062A\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0646\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064F \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u0647\u06E1\u062F\u0650 \u0635\u064E\u0628\u0650\u064A\u0651\u0657\u0627" }, { id: 30, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0639\u064E\u0628\u06E1\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0646\u0650\u064A\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0646\u0650\u064A \u0646\u064E\u0628\u0650\u064A\u0651\u0657\u0627" }, { id: 31, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0646\u0650\u064A \u0645\u064F\u0628\u064E\u0627\u0631\u064E\u0643\u064B\u0627 \u0623\u064E\u064A\u06E1\u0646\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F \u0648\u064E\u0623\u064E\u0648\u06E1\u0635\u064E\u0670\u0646\u0650\u064A \u0628\u0650\u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u0650 \u0645\u064E\u0627 \u062F\u064F\u0645\u06E1\u062A\u064F \u062D\u064E\u064A\u0651\u0657\u0627" }, { id: 32, text: "\u0648\u064E\u0628\u064E\u0631\u0651\u064E\u06E2\u0627 \u0628\u0650\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u062A\u0650\u064A \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u0650\u064A \u062C\u064E\u0628\u0651\u064E\u0627\u0631\u0657\u0627 \u0634\u064E\u0642\u0650\u064A\u0651\u0657\u0627" }, { id: 33, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0670\u0645\u064F \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0648\u064F\u0644\u0650\u062F\u062A\u0651\u064F \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0623\u064E\u0645\u064F\u0648\u062A\u064F \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0623\u064F\u0628\u06E1\u0639\u064E\u062B\u064F \u062D\u064E\u064A\u0651\u0657\u0627" }, { id: 34, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E\u06D6 \u0642\u064E\u0648\u06E1\u0644\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u0645\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0645\u0650\u0646 \u0648\u064E\u0644\u064E\u062F\u0656\u06D6 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0636\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0631\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u064E\u0647\u064F\u06E5 \u0643\u064F\u0646 \u0641\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F" }, { id: 36, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0647\u064F\u06DA \u0647\u064E\u0670\u0630\u064E\u0627 \u0635\u0650\u0631\u064E\u0670\u0637\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u065E" }, { id: 37, text: "\u0641\u064E\u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064E \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0645\u0651\u064E\u0634\u06E1\u0647\u064E\u062F\u0650 \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u064D" }, { id: 38, text: "\u0623\u064E\u0633\u06E1\u0645\u0650\u0639\u06E1 \u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0628\u06E1\u0635\u0650\u0631\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E\u0646\u064E\u0627 \u0644\u064E\u0670\u0643\u0650\u0646\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 39, text: "\u0648\u064E\u0623\u064E\u0646\u0630\u0650\u0631\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u062D\u064E\u0633\u06E1\u0631\u064E\u0629\u0650 \u0625\u0650\u0630\u06E1 \u0642\u064F\u0636\u0650\u064A\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u063A\u064E\u0641\u06E1\u0644\u064E\u0629\u0656 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0646\u064E\u0631\u0650\u062B\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u064E\u0646\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u064A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 41, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0635\u0650\u062F\u0651\u0650\u064A\u0642\u0657\u0627 \u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064B\u0627" }, { id: 42, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0623\u064E\u0628\u0650\u064A\u0647\u0650 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u062A\u0650 \u0644\u0650\u0645\u064E \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A \u0639\u064E\u0646\u0643\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627" }, { id: 43, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u062A\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u0643\u064E \u0641\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u06E1\u0646\u0650\u064A\u0653 \u0623\u064E\u0647\u06E1\u062F\u0650\u0643\u064E \u0635\u0650\u0631\u064E\u0670\u0637\u0657\u0627 \u0633\u064E\u0648\u0650\u064A\u0651\u0657\u0627" }, { id: 44, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u062A\u0650 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064E \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0639\u064E\u0635\u0650\u064A\u0651\u0657\u0627" }, { id: 45, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u062A\u0650 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0623\u064E\u0646 \u064A\u064E\u0645\u064E\u0633\u0651\u064E\u0643\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0641\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627" }, { id: 46, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0631\u064E\u0627\u063A\u0650\u0628\u064C \u0623\u064E\u0646\u062A\u064E \u0639\u064E\u0646\u06E1 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u0650\u064A \u064A\u064E\u0640\u0670\u0653\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064F\u06D6 \u0644\u064E\u0626\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0646\u062A\u064E\u0647\u0650 \u0644\u064E\u0623\u064E\u0631\u06E1\u062C\u064F\u0645\u064E\u0646\u0651\u064E\u0643\u064E\u06D6 \u0648\u064E\u0671\u0647\u06E1\u062C\u064F\u0631\u06E1\u0646\u0650\u064A \u0645\u064E\u0644\u0650\u064A\u0651\u0657\u0627" }, { id: 47, text: "\u0642\u064E\u0627\u0644\u064E \u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0633\u064E\u0623\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0644\u064E\u0643\u064E \u0631\u064E\u0628\u0651\u0650\u064A\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u064A \u062D\u064E\u0641\u0650\u064A\u0651\u0657\u0627" }, { id: 48, text: "\u0648\u064E\u0623\u064E\u0639\u06E1\u062A\u064E\u0632\u0650\u0644\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u0650\u064A \u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0643\u064F\u0648\u0646\u064E \u0628\u0650\u062F\u064F\u0639\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u0634\u064E\u0642\u0650\u064A\u0651\u0657\u0627" }, { id: 49, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0671\u0639\u06E1\u062A\u064E\u0632\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0647\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E\u06D6 \u0648\u064E\u0643\u064F\u0644\u0651\u0657\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0646\u064E\u0628\u0650\u064A\u0651\u0657\u0627" }, { id: 50, text: "\u0648\u064E\u0648\u064E\u0647\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0644\u0650\u0633\u064E\u0627\u0646\u064E \u0635\u0650\u062F\u06E1\u0642\u064D \u0639\u064E\u0644\u0650\u064A\u0651\u0657\u0627" }, { id: 51, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0645\u064F\u062E\u06E1\u0644\u064E\u0635\u0657\u0627 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0657\u0627" }, { id: 52, text: "\u0648\u064E\u0646\u064E\u0670\u062F\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646 \u062C\u064E\u0627\u0646\u0650\u0628\u0650 \u0671\u0644\u0637\u0651\u064F\u0648\u0631\u0650 \u0671\u0644\u06E1\u0623\u064E\u064A\u06E1\u0645\u064E\u0646\u0650 \u0648\u064E\u0642\u064E\u0631\u0651\u064E\u0628\u06E1\u0646\u064E\u0670\u0647\u064F \u0646\u064E\u062C\u0650\u064A\u0651\u0657\u0627" }, { id: 53, text: "\u0648\u064E\u0648\u064E\u0647\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0646\u064E\u0627\u0653 \u0623\u064E\u062E\u064E\u0627\u0647\u064F \u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0646\u064E\u0628\u0650\u064A\u0651\u0657\u0627" }, { id: 54, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0635\u064E\u0627\u062F\u0650\u0642\u064E \u0671\u0644\u06E1\u0648\u064E\u0639\u06E1\u062F\u0650 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0657\u0627" }, { id: 55, text: "\u0648\u064E\u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F \u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0645\u064E\u0631\u06E1\u0636\u0650\u064A\u0651\u0657\u0627" }, { id: 56, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0625\u0650\u062F\u06E1\u0631\u0650\u064A\u0633\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0635\u0650\u062F\u0651\u0650\u064A\u0642\u0657\u0627 \u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0657\u0627" }, { id: 57, text: "\u0648\u064E\u0631\u064E\u0641\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u064E\u0643\u064E\u0627\u0646\u064B\u0627 \u0639\u064E\u0644\u0650\u064A\u0651\u064B\u0627" }, { id: 58, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0645\u0650\u0646 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u0650 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0646\u06E1 \u062D\u064E\u0645\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0639\u064E \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0645\u0650\u0646 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0629\u0650 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0646\u06E1 \u0647\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0671\u062C\u06E1\u062A\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0627\u0653\u06DA \u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u062E\u064E\u0631\u0651\u064F\u0648\u0627\u0652\u06E4 \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627\u06E4 \u0648\u064E\u0628\u064F\u0643\u0650\u064A\u0651\u0657\u0627\u06E9" }, { id: 59, text: "\u06DE\u0641\u064E\u062E\u064E\u0644\u064E\u0641\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u062E\u064E\u0644\u06E1\u0641\u064C \u0623\u064E\u0636\u064E\u0627\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0648\u064E\u0670\u062A\u0650\u06D6 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0644\u06E1\u0642\u064E\u0648\u06E1\u0646\u064E \u063A\u064E\u064A\u0651\u064B\u0627" }, { id: 60, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u062A\u064E\u0627\u0628\u064E \u0648\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627" }, { id: 61, text: "\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0639\u064E\u062F\u06E1\u0646\u064D \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0648\u064E\u0639\u064E\u062F\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0648\u064E\u0639\u06E1\u062F\u064F\u0647\u064F\u06E5 \u0645\u064E\u0623\u06E1\u062A\u0650\u064A\u0651\u0657\u0627" }, { id: 62, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064E\u063A\u06E1\u0648\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u064E\u0644\u064E\u0670\u0645\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0631\u0650\u0632\u06E1\u0642\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0628\u064F\u0643\u06E1\u0631\u064E\u0629\u0657 \u0648\u064E\u0639\u064E\u0634\u0650\u064A\u0651\u0657\u0627" }, { id: 63, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0646\u064F\u0648\u0631\u0650\u062B\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627 \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u062A\u064E\u0642\u0650\u064A\u0651\u0657\u0627" }, { id: 64, text: "\u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062A\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0646\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u06E1\u0641\u064E\u0646\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0646\u064E\u0633\u0650\u064A\u0651\u0657\u0627" }, { id: 65, text: "\u0631\u0651\u064E\u0628\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u06E1\u0647\u064F \u0648\u064E\u0671\u0635\u06E1\u0637\u064E\u0628\u0650\u0631\u06E1 \u0644\u0650\u0639\u0650\u0628\u064E\u0670\u062F\u064E\u062A\u0650\u0647\u0650\u06E6\u06DA \u0647\u064E\u0644\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0644\u064E\u0647\u064F\u06E5 \u0633\u064E\u0645\u0650\u064A\u0651\u0657\u0627" }, { id: 66, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0645\u064E\u0627 \u0645\u0650\u062A\u0651\u064F \u0644\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u0623\u064F\u062E\u06E1\u0631\u064E\u062C\u064F \u062D\u064E\u064A\u0651\u064B\u0627" }, { id: 67, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0623\u064E\u0646\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627" }, { id: 68, text: "\u0641\u064E\u0648\u064E\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0646\u064E\u062D\u06E1\u0634\u064F\u0631\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064E \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0646\u064F\u062D\u06E1\u0636\u0650\u0631\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u0648\u06E1\u0644\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062C\u0650\u062B\u0650\u064A\u0651\u0657\u0627" }, { id: 69, text: "\u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0646\u064E\u0646\u0632\u0650\u0639\u064E\u0646\u0651\u064E \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0634\u0650\u064A\u0639\u064E\u0629\u064D \u0623\u064E\u064A\u0651\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0639\u0650\u062A\u0650\u064A\u0651\u0657\u0627" }, { id: 70, text: "\u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0628\u0650\u0647\u064E\u0627 \u0635\u0650\u0644\u0650\u064A\u0651\u0657\u0627" }, { id: 71, text: "\u0648\u064E\u0625\u0650\u0646 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u0627\u0631\u0650\u062F\u064F\u0647\u064E\u0627\u06DA \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u062D\u064E\u062A\u06E1\u0645\u0657\u0627 \u0645\u0651\u064E\u0642\u06E1\u0636\u0650\u064A\u0651\u0657\u0627" }, { id: 72, text: "\u062B\u064F\u0645\u0651\u064E \u0646\u064F\u0646\u064E\u062C\u0651\u0650\u064A \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0646\u064E\u0630\u064E\u0631\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u062C\u0650\u062B\u0650\u064A\u0651\u0657\u0627" }, { id: 73, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u0651\u064F \u0671\u0644\u06E1\u0641\u064E\u0631\u0650\u064A\u0642\u064E\u064A\u06E1\u0646\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u064E\u0642\u064E\u0627\u0645\u0657\u0627 \u0648\u064E\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0646\u064E\u062F\u0650\u064A\u0651\u0657\u0627" }, { id: 74, text: "\u0648\u064E\u0643\u064E\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u0646\u064D \u0647\u064F\u0645\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0623\u064E\u062B\u064E\u0670\u062B\u0657\u0627 \u0648\u064E\u0631\u0650\u0621\u06E1\u064A\u0657\u0627" }, { id: 75, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0636\u0651\u064E\u0644\u064E\u0670\u0644\u064E\u0629\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u0645\u06E1\u062F\u064F\u062F\u06E1 \u0644\u064E\u0647\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0645\u064E\u062F\u0651\u064B\u0627\u06DA \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0627\u0652 \u0645\u064E\u0627 \u064A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E \u0625\u0650\u0645\u0651\u064E\u0627 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0641\u064E\u0633\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0634\u064E\u0631\u0651\u065E \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u0657\u0627 \u0648\u064E\u0623\u064E\u0636\u06E1\u0639\u064E\u0641\u064F \u062C\u064F\u0646\u062F\u0657\u0627" }, { id: 76, text: "\u0648\u064E\u064A\u064E\u0632\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0648\u06E1\u0627\u0652 \u0647\u064F\u062F\u0657\u0649\u06D7 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0670\u0642\u0650\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u064F \u062E\u064E\u064A\u06E1\u0631\u064C \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u062B\u064E\u0648\u064E\u0627\u0628\u0657\u0627 \u0648\u064E\u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u064E\u0631\u064E\u062F\u0651\u064B\u0627" }, { id: 77, text: "\u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064E\u0641\u064E\u0631\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0623\u064F\u0648\u062A\u064E\u064A\u064E\u0646\u0651\u064E \u0645\u064E\u0627\u0644\u0657\u0627 \u0648\u064E\u0648\u064E\u0644\u064E\u062F\u064B\u0627" }, { id: 78, text: "\u0623\u064E\u0637\u0651\u064E\u0644\u064E\u0639\u064E \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u064E \u0623\u064E\u0645\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0639\u064E\u0647\u06E1\u062F\u0657\u0627" }, { id: 79, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u06DA \u0633\u064E\u0646\u064E\u0643\u06E1\u062A\u064F\u0628\u064F \u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0648\u064E\u0646\u064E\u0645\u064F\u062F\u0651\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0645\u064E\u062F\u0651\u0657\u0627" }, { id: 80, text: "\u0648\u064E\u0646\u064E\u0631\u0650\u062B\u064F\u0647\u064F\u06E5 \u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0648\u064E\u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E\u0627 \u0641\u064E\u0631\u06E1\u062F\u0657\u0627" }, { id: 81, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u0657 \u0644\u0651\u0650\u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u0650\u0632\u0651\u0657\u0627" }, { id: 82, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u06DA \u0633\u064E\u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0636\u0650\u062F\u0651\u064B\u0627" }, { id: 83, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u062A\u064E\u0624\u064F\u0632\u0651\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0632\u0651\u0657\u0627" }, { id: 84, text: "\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062C\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0646\u064E\u0639\u064F\u062F\u0651\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u062F\u0651\u0657\u0627" }, { id: 85, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u062D\u06E1\u0634\u064F\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0648\u064E\u0641\u06E1\u062F\u0657\u0627" }, { id: 86, text: "\u0648\u064E\u0646\u064E\u0633\u064F\u0648\u0642\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0648\u0650\u0631\u06E1\u062F\u0657\u0627" }, { id: 87, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0639\u064E\u0647\u06E1\u062F\u0657\u0627" }, { id: 88, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0648\u064E\u0644\u064E\u062F\u0657\u0627" }, { id: 89, text: "\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627 \u0625\u0650\u062F\u0651\u0657\u0627" }, { id: 90, text: "\u062A\u064E\u0643\u064E\u0627\u062F\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u064F \u064A\u064E\u062A\u064E\u0641\u064E\u0637\u0651\u064E\u0631\u06E1\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u062A\u064E\u0646\u0634\u064E\u0642\u0651\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0648\u064E\u062A\u064E\u062E\u0650\u0631\u0651\u064F \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0647\u064E\u062F\u0651\u064B\u0627" }, { id: 91, text: "\u0623\u064E\u0646 \u062F\u064E\u0639\u064E\u0648\u06E1\u0627\u0652 \u0644\u0650\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0648\u064E\u0644\u064E\u062F\u0657\u0627" }, { id: 92, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0646\u06E2\u0628\u064E\u063A\u0650\u064A \u0644\u0650\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0623\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0648\u064E\u0644\u064E\u062F\u064B\u0627" }, { id: 93, text: "\u0625\u0650\u0646 \u0643\u064F\u0644\u0651\u064F \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u0650\u064A \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0639\u064E\u0628\u06E1\u062F\u0657\u0627" }, { id: 94, text: "\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u062D\u06E1\u0635\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0639\u064E\u062F\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u062F\u0651\u0657\u0627" }, { id: 95, text: "\u0648\u064E\u0643\u064F\u0644\u0651\u064F\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u062A\u0650\u064A\u0647\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0641\u064E\u0631\u06E1\u062F\u064B\u0627" }, { id: 96, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0633\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0648\u064F\u062F\u0651\u0657\u0627" }, { id: 97, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u0650\u0644\u0650\u0633\u064E\u0627\u0646\u0650\u0643\u064E \u0644\u0650\u062A\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064E \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u062A\u064F\u0646\u0630\u0650\u0631\u064E \u0628\u0650\u0647\u0650\u06E6 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0644\u0651\u064F\u062F\u0651\u0657\u0627" }, { id: 98, text: "\u0648\u064E\u0643\u064E\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u0646\u064D \u0647\u064E\u0644\u06E1 \u062A\u064F\u062D\u0650\u0633\u0651\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u064D \u0623\u064E\u0648\u06E1 \u062A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0631\u0650\u0643\u06E1\u0632\u064E\u06E2\u0627" }] }, { id: 20, name: "\u0637\u0647", transliteration: "Taha", type: "meccan", total_verses: 135, verses: [{ id: 1, text: "\u0637\u0647" }, { id: 2, text: "\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0644\u0650\u062A\u064E\u0634\u06E1\u0642\u064E\u0649\u0670\u0653" }, { id: 3, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u0630\u06E1\u0643\u0650\u0631\u064E\u0629\u0657 \u0644\u0651\u0650\u0645\u064E\u0646 \u064A\u064E\u062E\u06E1\u0634\u064E\u0649\u0670" }, { id: 4, text: "\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0671\u0644\u06E1\u0639\u064F\u0644\u064E\u0649" }, { id: 5, text: "\u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670" }, { id: 6, text: "\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u062D\u06E1\u062A\u064E \u0671\u0644\u062B\u0651\u064E\u0631\u064E\u0649\u0670" }, { id: 7, text: "\u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u062C\u06E1\u0647\u064E\u0631\u06E1 \u0628\u0650\u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u0633\u0651\u0650\u0631\u0651\u064E \u0648\u064E\u0623\u064E\u062E\u06E1\u0641\u064E\u0649" }, { id: 8, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670" }, { id: 9, text: "\u0648\u064E\u0647\u064E\u0644\u06E1 \u0623\u064E\u062A\u064E\u0649\u0670\u0643\u064E \u062D\u064E\u062F\u0650\u064A\u062B\u064F \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653" }, { id: 10, text: "\u0625\u0650\u0630\u06E1 \u0631\u064E\u0621\u064E\u0627 \u0646\u064E\u0627\u0631\u0657\u0627 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650 \u0671\u0645\u06E1\u0643\u064F\u062B\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0621\u064E\u0627\u0646\u064E\u0633\u06E1\u062A\u064F \u0646\u064E\u0627\u0631\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u0650\u064A\u0653 \u0621\u064E\u0627\u062A\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u0628\u0650\u0642\u064E\u0628\u064E\u0633\u064D \u0623\u064E\u0648\u06E1 \u0623\u064E\u062C\u0650\u062F\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0647\u064F\u062F\u0657\u0649" }, { id: 11, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064E\u0627 \u0646\u064F\u0648\u062F\u0650\u064A\u064E \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653" }, { id: 12, text: "\u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0641\u064E\u0671\u062E\u06E1\u0644\u064E\u0639\u06E1 \u0646\u064E\u0639\u06E1\u0644\u064E\u064A\u06E1\u0643\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u0648\u064E\u0627\u062F\u0650 \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u062F\u0651\u064E\u0633\u0650 \u0637\u064F\u0648\u0657\u0649" }, { id: 13, text: "\u0648\u064E\u0623\u064E\u0646\u064E\u0627 \u0671\u062E\u06E1\u062A\u064E\u0631\u06E1\u062A\u064F\u0643\u064E \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u06E1 \u0644\u0650\u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653" }, { id: 14, text: "\u0625\u0650\u0646\u0651\u064E\u0646\u0650\u064A\u0653 \u0623\u064E\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u06E1\u0646\u0650\u064A \u0648\u064E\u0623\u064E\u0642\u0650\u0645\u0650 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0644\u0650\u0630\u0650\u0643\u06E1\u0631\u0650\u064A\u0653" }, { id: 15, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0621\u064E\u0627\u062A\u0650\u064A\u064E\u0629\u064C \u0623\u064E\u0643\u064E\u0627\u062F\u064F \u0623\u064F\u062E\u06E1\u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u0650\u062A\u064F\u062C\u06E1\u0632\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0633\u06E1\u0639\u064E\u0649\u0670" }, { id: 16, text: "\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0635\u064F\u062F\u0651\u064E\u0646\u0651\u064E\u0643\u064E \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0645\u064E\u0646 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0647\u064E\u0648\u064E\u0649\u0670\u0647\u064F \u0641\u064E\u062A\u064E\u0631\u06E1\u062F\u064E\u0649\u0670" }, { id: 17, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u0650\u0644\u06E1\u0643\u064E \u0628\u0650\u064A\u064E\u0645\u0650\u064A\u0646\u0650\u0643\u064E \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 18, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u0650\u064A\u064E \u0639\u064E\u0635\u064E\u0627\u064A\u064E \u0623\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0624\u064F\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0647\u064F\u0634\u0651\u064F \u0628\u0650\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u063A\u064E\u0646\u064E\u0645\u0650\u064A \u0648\u064E\u0644\u0650\u064A\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0640\u0654\u064E\u0627\u0631\u0650\u0628\u064F \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670" }, { id: 19, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0644\u06E1\u0642\u0650\u0647\u064E\u0627 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 20, text: "\u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670\u0647\u064E\u0627 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u0650\u064A\u064E \u062D\u064E\u064A\u0651\u064E\u0629\u065E \u062A\u064E\u0633\u06E1\u0639\u064E\u0649\u0670" }, { id: 21, text: "\u0642\u064E\u0627\u0644\u064E \u062E\u064F\u0630\u06E1\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0641\u06E1\u06D6 \u0633\u064E\u0646\u064F\u0639\u0650\u064A\u062F\u064F\u0647\u064E\u0627 \u0633\u0650\u064A\u0631\u064E\u062A\u064E\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670" }, { id: 22, text: "\u0648\u064E\u0671\u0636\u06E1\u0645\u064F\u0645\u06E1 \u064A\u064E\u062F\u064E\u0643\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u062C\u064E\u0646\u064E\u0627\u062D\u0650\u0643\u064E \u062A\u064E\u062E\u06E1\u0631\u064F\u062C\u06E1 \u0628\u064E\u064A\u06E1\u0636\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646\u06E1 \u063A\u064E\u064A\u06E1\u0631\u0650 \u0633\u064F\u0648\u0653\u0621\u064D \u0621\u064E\u0627\u064A\u064E\u0629\u064B \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670" }, { id: 23, text: "\u0644\u0650\u0646\u064F\u0631\u0650\u064A\u064E\u0643\u064E \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0643\u064F\u0628\u06E1\u0631\u064E\u0649" }, { id: 24, text: "\u0671\u0630\u06E1\u0647\u064E\u0628\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0637\u064E\u063A\u064E\u0649\u0670" }, { id: 25, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u0634\u06E1\u0631\u064E\u062D\u06E1 \u0644\u0650\u064A \u0635\u064E\u062F\u06E1\u0631\u0650\u064A" }, { id: 26, text: "\u0648\u064E\u064A\u064E\u0633\u0651\u0650\u0631\u06E1 \u0644\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1\u0631\u0650\u064A" }, { id: 27, text: "\u0648\u064E\u0671\u062D\u06E1\u0644\u064F\u0644\u06E1 \u0639\u064F\u0642\u06E1\u062F\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0644\u0651\u0650\u0633\u064E\u0627\u0646\u0650\u064A" }, { id: 28, text: "\u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0644\u0650\u064A" }, { id: 29, text: "\u0648\u064E\u0671\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u0650\u064A \u0648\u064E\u0632\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650\u064A" }, { id: 30, text: "\u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0623\u064E\u062E\u0650\u064A" }, { id: 31, text: "\u0671\u0634\u06E1\u062F\u064F\u062F\u06E1 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0632\u06E1\u0631\u0650\u064A" }, { id: 32, text: "\u0648\u064E\u0623\u064E\u0634\u06E1\u0631\u0650\u0643\u06E1\u0647\u064F \u0641\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1\u0631\u0650\u064A" }, { id: 33, text: "\u0643\u064E\u064A\u06E1 \u0646\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064E\u0643\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627" }, { id: 34, text: "\u0648\u064E\u0646\u064E\u0630\u06E1\u0643\u064F\u0631\u064E\u0643\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u064B\u0627" }, { id: 35, text: "\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0643\u064F\u0646\u062A\u064E \u0628\u0650\u0646\u064E\u0627 \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 36, text: "\u0642\u064E\u0627\u0644\u064E \u0642\u064E\u062F\u06E1 \u0623\u064F\u0648\u062A\u0650\u064A\u062A\u064E \u0633\u064F\u0624\u06E1\u0644\u064E\u0643\u064E \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 37, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0645\u064E\u0646\u064E\u0646\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u064B \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u0653" }, { id: 38, text: "\u0625\u0650\u0630\u06E1 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u0651\u0650\u0643\u064E \u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653" }, { id: 39, text: "\u0623\u064E\u0646\u0650 \u0671\u0642\u06E1\u0630\u0650\u0641\u0650\u064A\u0647\u0650 \u0641\u0650\u064A \u0671\u0644\u062A\u0651\u064E\u0627\u0628\u064F\u0648\u062A\u0650 \u0641\u064E\u0671\u0642\u06E1\u0630\u0650\u0641\u0650\u064A\u0647\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u064A\u064E\u0645\u0651\u0650 \u0641\u064E\u0644\u06E1\u064A\u064F\u0644\u06E1\u0642\u0650\u0647\u0650 \u0671\u0644\u06E1\u064A\u064E\u0645\u0651\u064F \u0628\u0650\u0671\u0644\u0633\u0651\u064E\u0627\u062D\u0650\u0644\u0650 \u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u06E1\u0647\u064F \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0644\u0651\u0650\u064A \u0648\u064E\u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0644\u0651\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u064A\u06E1\u062A\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u064E\u062D\u064E\u0628\u0651\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u0651\u0650\u064A \u0648\u064E\u0644\u0650\u062A\u064F\u0635\u06E1\u0646\u064E\u0639\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u064A\u06E1\u0646\u0650\u064A\u0653" }, { id: 40, text: "\u0625\u0650\u0630\u06E1 \u062A\u064E\u0645\u06E1\u0634\u0650\u064A\u0653 \u0623\u064F\u062E\u06E1\u062A\u064F\u0643\u064E \u0641\u064E\u062A\u064E\u0642\u064F\u0648\u0644\u064F \u0647\u064E\u0644\u06E1 \u0623\u064E\u062F\u064F\u0644\u0651\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0644\u064F\u0647\u064F\u06E5\u06D6 \u0641\u064E\u0631\u064E\u062C\u064E\u0639\u06E1\u0646\u064E\u0670\u0643\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u0651\u0650\u0643\u064E \u0643\u064E\u064A\u06E1 \u062A\u064E\u0642\u064E\u0631\u0651\u064E \u0639\u064E\u064A\u06E1\u0646\u064F\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u064E\u06DA \u0648\u064E\u0642\u064E\u062A\u064E\u0644\u06E1\u062A\u064E \u0646\u064E\u0641\u06E1\u0633\u0657\u0627 \u0641\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0645\u0651\u0650 \u0648\u064E\u0641\u064E\u062A\u064E\u0646\u0651\u064E\u0640\u0670\u0643\u064E \u0641\u064F\u062A\u064F\u0648\u0646\u0657\u0627\u06DA \u0641\u064E\u0644\u064E\u0628\u0650\u062B\u06E1\u062A\u064E \u0633\u0650\u0646\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0645\u064E\u062F\u06E1\u064A\u064E\u0646\u064E \u062B\u064F\u0645\u0651\u064E \u062C\u0650\u0626\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u062F\u064E\u0631\u0656 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 41, text: "\u0648\u064E\u0671\u0635\u06E1\u0637\u064E\u0646\u064E\u0639\u06E1\u062A\u064F\u0643\u064E \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u064A" }, { id: 42, text: "\u0671\u0630\u06E1\u0647\u064E\u0628\u06E1 \u0623\u064E\u0646\u062A\u064E \u0648\u064E\u0623\u064E\u062E\u064F\u0648\u0643\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u0650\u064A\u064E\u0627 \u0641\u0650\u064A \u0630\u0650\u0643\u06E1\u0631\u0650\u064A" }, { id: 43, text: "\u0671\u0630\u06E1\u0647\u064E\u0628\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0637\u064E\u063A\u064E\u0649\u0670" }, { id: 44, text: "\u0641\u064E\u0642\u064F\u0648\u0644\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0644\u0651\u064E\u064A\u0651\u0650\u0646\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F \u0623\u064E\u0648\u06E1 \u064A\u064E\u062E\u06E1\u0634\u064E\u0649\u0670" }, { id: 45, text: "\u0642\u064E\u0627\u0644\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0646\u064E\u0627 \u0646\u064E\u062E\u064E\u0627\u0641\u064F \u0623\u064E\u0646 \u064A\u064E\u0641\u06E1\u0631\u064F\u0637\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0646 \u064A\u064E\u0637\u06E1\u063A\u064E\u0649\u0670" }, { id: 46, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0627\u0641\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0646\u0650\u064A \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u0648\u064E\u0623\u064E\u0631\u064E\u0649\u0670" }, { id: 47, text: "\u0641\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0627\u0647\u064F \u0641\u064E\u0642\u064F\u0648\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0627 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u0650\u0644\u06E1 \u0645\u064E\u0639\u064E\u0646\u064E\u0627 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u0646\u064E\u0670\u0643\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0670\u0645\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670\u0653" }, { id: 48, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0642\u064E\u062F\u06E1 \u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0648\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670" }, { id: 49, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0645\u064E\u0646 \u0631\u0651\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u064E\u0627 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 50, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0637\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D \u062E\u064E\u0644\u06E1\u0642\u064E\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u0647\u064E\u062F\u064E\u0649\u0670" }, { id: 51, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0645\u064E\u0627 \u0628\u064E\u0627\u0644\u064F \u0671\u0644\u06E1\u0642\u064F\u0631\u064F\u0648\u0646\u0650 \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670" }, { id: 52, text: "\u0642\u064E\u0627\u0644\u064E \u0639\u0650\u0644\u06E1\u0645\u064F\u0647\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0656\u06D6 \u0644\u0651\u064E\u0627 \u064A\u064E\u0636\u0650\u0644\u0651\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0646\u0633\u064E\u0649" }, { id: 53, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0645\u064E\u0647\u06E1\u062F\u0657\u0627 \u0648\u064E\u0633\u064E\u0644\u064E\u0643\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0633\u064F\u0628\u064F\u0644\u0657\u0627 \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0628\u064E\u0627\u062A\u0656 \u0634\u064E\u062A\u0651\u064E\u0649\u0670" }, { id: 54, text: "\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0631\u06E1\u0639\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u064E\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u0646\u0651\u064F\u0647\u064E\u0649\u0670" }, { id: 55, text: "\u06DE\u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0641\u0650\u064A\u0647\u064E\u0627 \u0646\u064F\u0639\u0650\u064A\u062F\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0646\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0643\u064F\u0645\u06E1 \u062A\u064E\u0627\u0631\u064E\u0629\u064B \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670" }, { id: 56, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0643\u064F\u0644\u0651\u064E\u0647\u064E\u0627 \u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0648\u064E\u0623\u064E\u0628\u064E\u0649\u0670" }, { id: 57, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u062C\u0650\u0626\u06E1\u062A\u064E\u0646\u064E\u0627 \u0644\u0650\u062A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0636\u0650\u0646\u064E\u0627 \u0628\u0650\u0633\u0650\u062D\u06E1\u0631\u0650\u0643\u064E \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 58, text: "\u0641\u064E\u0644\u064E\u0646\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0628\u0650\u0633\u0650\u062D\u06E1\u0631\u0656 \u0645\u0651\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u0671\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064E \u0645\u064E\u0648\u06E1\u0639\u0650\u062F\u0657\u0627 \u0644\u0651\u064E\u0627 \u0646\u064F\u062E\u06E1\u0644\u0650\u0641\u064F\u0647\u064F\u06E5 \u0646\u064E\u062D\u06E1\u0646\u064F \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0645\u064E\u0643\u064E\u0627\u0646\u0657\u0627 \u0633\u064F\u0648\u0657\u0649" }, { id: 59, text: "\u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0648\u06E1\u0639\u0650\u062F\u064F\u0643\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u0632\u0651\u0650\u064A\u0646\u064E\u0629\u0650 \u0648\u064E\u0623\u064E\u0646 \u064A\u064F\u062D\u06E1\u0634\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0636\u064F\u062D\u0657\u0649" }, { id: 60, text: "\u0641\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0641\u064E\u062C\u064E\u0645\u064E\u0639\u064E \u0643\u064E\u064A\u06E1\u062F\u064E\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062A\u064E\u0649\u0670" }, { id: 61, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u064A\u06E1\u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u0657\u0627 \u0641\u064E\u064A\u064F\u0633\u06E1\u062D\u0650\u062A\u064E\u0643\u064F\u0645 \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u0656\u06D6 \u0648\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0627\u0628\u064E \u0645\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670" }, { id: 62, text: "\u0641\u064E\u062A\u064E\u0646\u064E\u0670\u0632\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0631\u064E\u0647\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0633\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u062C\u06E1\u0648\u064E\u0649\u0670" }, { id: 63, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0670\u0646\u0650 \u0644\u064E\u0633\u064E\u0670\u062D\u0650\u0631\u064E\u0670\u0646\u0650 \u064A\u064F\u0631\u0650\u064A\u062F\u064E\u0627\u0646\u0650 \u0623\u064E\u0646 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0627\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0636\u0650\u0643\u064F\u0645 \u0628\u0650\u0633\u0650\u062D\u06E1\u0631\u0650\u0647\u0650\u0645\u064E\u0627 \u0648\u064E\u064A\u064E\u0630\u06E1\u0647\u064E\u0628\u064E\u0627 \u0628\u0650\u0637\u064E\u0631\u0650\u064A\u0642\u064E\u062A\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u062B\u06E1\u0644\u064E\u0649\u0670" }, { id: 64, text: "\u0641\u064E\u0623\u064E\u062C\u06E1\u0645\u0650\u0639\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u062F\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0671\u0626\u06E1\u062A\u064F\u0648\u0627\u0652 \u0635\u064E\u0641\u0651\u0657\u0627\u06DA \u0648\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0641\u06E1\u0644\u064E\u062D\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0645\u064E\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0639\u06E1\u0644\u064E\u0649\u0670" }, { id: 65, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064F\u0644\u06E1\u0642\u0650\u064A\u064E \u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064E\u0643\u064F\u0648\u0646\u064E \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0646\u06E1 \u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670" }, { id: 66, text: "\u0642\u064E\u0627\u0644\u064E \u0628\u064E\u0644\u06E1 \u0623\u064E\u0644\u06E1\u0642\u064F\u0648\u0627\u0652\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062D\u0650\u0628\u064E\u0627\u0644\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0639\u0650\u0635\u0650\u064A\u0651\u064F\u0647\u064F\u0645\u06E1 \u064A\u064F\u062E\u064E\u064A\u0651\u064E\u0644\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646 \u0633\u0650\u062D\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064E\u0627 \u062A\u064E\u0633\u06E1\u0639\u064E\u0649\u0670" }, { id: 67, text: "\u0641\u064E\u0623\u064E\u0648\u06E1\u062C\u064E\u0633\u064E \u0641\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u062E\u0650\u064A\u0641\u064E\u0629\u0657 \u0645\u0651\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 68, text: "\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0641\u06E1 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0649\u0670" }, { id: 69, text: "\u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u064A\u064E\u0645\u0650\u064A\u0646\u0650\u0643\u064E \u062A\u064E\u0644\u06E1\u0642\u064E\u0641\u06E1 \u0645\u064E\u0627 \u0635\u064E\u0646\u064E\u0639\u064F\u0648\u0653\u0627\u0652\u06D6 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0635\u064E\u0646\u064E\u0639\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u062F\u064F \u0633\u064E\u0670\u062D\u0650\u0631\u0656\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u062D\u0650\u0631\u064F \u062D\u064E\u064A\u06E1\u062B\u064F \u0623\u064E\u062A\u064E\u0649\u0670" }, { id: 70, text: "\u0641\u064E\u0623\u064F\u0644\u06E1\u0642\u0650\u064A\u064E \u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0631\u064E\u0629\u064F \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0631\u064E\u0628\u0651\u0650 \u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 71, text: "\u0642\u064E\u0627\u0644\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0642\u064E\u0628\u06E1\u0644\u064E \u0623\u064E\u0646\u06E1 \u0621\u064E\u0627\u0630\u064E\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0643\u064E\u0628\u0650\u064A\u0631\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0639\u064E\u0644\u0651\u064E\u0645\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u0650\u062D\u06E1\u0631\u064E\u06D6 \u0641\u064E\u0644\u064E\u0623\u064F\u0642\u064E\u0637\u0651\u0650\u0639\u064E\u0646\u0651\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u0650\u0644\u064E\u0670\u0641\u0656 \u0648\u064E\u0644\u064E\u0623\u064F\u0635\u064E\u0644\u0651\u0650\u0628\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u062C\u064F\u0630\u064F\u0648\u0639\u0650 \u0671\u0644\u0646\u0651\u064E\u062E\u06E1\u0644\u0650 \u0648\u064E\u0644\u064E\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0646\u0651\u064E \u0623\u064E\u064A\u0651\u064F\u0646\u064E\u0627\u0653 \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0648\u064E\u0623\u064E\u0628\u06E1\u0642\u064E\u0649\u0670" }, { id: 72, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u0646\u0651\u064F\u0624\u06E1\u062B\u0650\u0631\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u064E\u0637\u064E\u0631\u064E\u0646\u064E\u0627\u06D6 \u0641\u064E\u0671\u0642\u06E1\u0636\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0642\u064E\u0627\u0636\u064D\u06D6 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062A\u064E\u0642\u06E1\u0636\u0650\u064A \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u0653" }, { id: 73, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0644\u0650\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0644\u064E\u0646\u064E\u0627 \u062E\u064E\u0637\u064E\u0670\u064A\u064E\u0670\u0646\u064E\u0627 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0643\u06E1\u0631\u064E\u0647\u06E1\u062A\u064E\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u0650\u062D\u06E1\u0631\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u064A\u06E1\u0631\u065E \u0648\u064E\u0623\u064E\u0628\u06E1\u0642\u064E\u0649\u0670\u0653" }, { id: 74, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u06E5 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0644\u064E\u0627 \u064A\u064E\u0645\u064F\u0648\u062A\u064F \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u064A\u064E\u0649\u0670" }, { id: 75, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u0647\u0650\u06E6 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0657\u0627 \u0642\u064E\u062F\u06E1 \u0639\u064E\u0645\u0650\u0644\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u062F\u0651\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u0639\u064F\u0644\u064E\u0649\u0670" }, { id: 76, text: "\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u064F \u0639\u064E\u062F\u06E1\u0646\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0645\u064E\u0646 \u062A\u064E\u0632\u064E\u0643\u0651\u064E\u0649\u0670" }, { id: 77, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0631\u0650 \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A \u0641\u064E\u0671\u0636\u06E1\u0631\u0650\u0628\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0637\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u064A\u064E\u0628\u064E\u0633\u0657\u0627 \u0644\u0651\u064E\u0627 \u062A\u064E\u062E\u064E\u0670\u0641\u064F \u062F\u064E\u0631\u064E\u0643\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u06E1\u0634\u064E\u0649\u0670" }, { id: 78, text: "\u0641\u064E\u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0628\u0650\u062C\u064F\u0646\u064F\u0648\u062F\u0650\u0647\u0650\u06E6 \u0641\u064E\u063A\u064E\u0634\u0650\u064A\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u064A\u064E\u0645\u0651\u0650 \u0645\u064E\u0627 \u063A\u064E\u0634\u0650\u064A\u064E\u0647\u064F\u0645\u06E1" }, { id: 79, text: "\u0648\u064E\u0623\u064E\u0636\u064E\u0644\u0651\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u06E5 \u0648\u064E\u0645\u064E\u0627 \u0647\u064E\u062F\u064E\u0649\u0670" }, { id: 80, text: "\u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0642\u064E\u062F\u06E1 \u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0648\u064E\u0670\u0639\u064E\u062F\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u062C\u064E\u0627\u0646\u0650\u0628\u064E \u0671\u0644\u0637\u0651\u064F\u0648\u0631\u0650 \u0671\u0644\u06E1\u0623\u064E\u064A\u06E1\u0645\u064E\u0646\u064E \u0648\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0646\u0651\u064E \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0644\u06E1\u0648\u064E\u0649\u0670" }, { id: 81, text: "\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0645\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0637\u06E1\u063A\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0641\u064E\u064A\u064E\u062D\u0650\u0644\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u063A\u064E\u0636\u064E\u0628\u0650\u064A\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062D\u06E1\u0644\u0650\u0644\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u063A\u064E\u0636\u064E\u0628\u0650\u064A \u0641\u064E\u0642\u064E\u062F\u06E1 \u0647\u064E\u0648\u064E\u0649\u0670" }, { id: 82, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u063A\u064E\u0641\u0651\u064E\u0627\u0631\u065E \u0644\u0651\u0650\u0645\u064E\u0646 \u062A\u064E\u0627\u0628\u064E \u0648\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0649\u0670" }, { id: 83, text: "\u06DE\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u062C\u064E\u0644\u064E\u0643\u064E \u0639\u064E\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0643\u064E \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 84, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u064F\u0645\u06E1 \u0623\u064F\u0648\u0652\u0644\u064E\u0627\u0653\u0621\u0650 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062B\u064E\u0631\u0650\u064A \u0648\u064E\u0639\u064E\u062C\u0650\u0644\u06E1\u062A\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0631\u064E\u0628\u0651\u0650 \u0644\u0650\u062A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670" }, { id: 85, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0642\u064E\u062F\u06E1 \u0641\u064E\u062A\u064E\u0646\u0651\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u064E\u0643\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0643\u064E \u0648\u064E\u0623\u064E\u0636\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0645\u0650\u0631\u0650\u064A\u0651\u064F" }, { id: 86, text: "\u0641\u064E\u0631\u064E\u062C\u064E\u0639\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u063A\u064E\u0636\u06E1\u0628\u064E\u0670\u0646\u064E \u0623\u064E\u0633\u0650\u0641\u0657\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0639\u0650\u062F\u06E1\u0643\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0639\u06E1\u062F\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u064B\u0627\u06DA \u0623\u064E\u0641\u064E\u0637\u064E\u0627\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0647\u06E1\u062F\u064F \u0623\u064E\u0645\u06E1 \u0623\u064E\u0631\u064E\u062F\u062A\u0651\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u062D\u0650\u0644\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u063A\u064E\u0636\u064E\u0628\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u062E\u06E1\u0644\u064E\u0641\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0648\u06E1\u0639\u0650\u062F\u0650\u064A" }, { id: 87, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0644\u064E\u0641\u06E1\u0646\u064E\u0627 \u0645\u064E\u0648\u06E1\u0639\u0650\u062F\u064E\u0643\u064E \u0628\u0650\u0645\u064E\u0644\u06E1\u0643\u0650\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E\u0627 \u062D\u064F\u0645\u0651\u0650\u0644\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u0632\u064E\u0627\u0631\u0657\u0627 \u0645\u0651\u0650\u0646 \u0632\u0650\u064A\u0646\u064E\u0629\u0650 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0641\u064E\u0642\u064E\u0630\u064E\u0641\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0641\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0644\u06E1\u0642\u064E\u0649 \u0671\u0644\u0633\u0651\u064E\u0627\u0645\u0650\u0631\u0650\u064A\u0651\u064F" }, { id: 88, text: "\u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u0650\u062C\u06E1\u0644\u0657\u0627 \u062C\u064E\u0633\u064E\u062F\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u06E5 \u062E\u064F\u0648\u064E\u0627\u0631\u065E \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0644\u064E\u0670\u0647\u064F \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0641\u064E\u0646\u064E\u0633\u0650\u064A\u064E" }, { id: 89, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0636\u064E\u0631\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0641\u06E1\u0639\u0657\u0627" }, { id: 90, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064F \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0641\u064F\u062A\u0650\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0641\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u0650\u064A \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0631\u0650\u064A" }, { id: 91, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u0646\u0651\u064E\u0628\u06E1\u0631\u064E\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0639\u064E\u0670\u0643\u0650\u0641\u0650\u064A\u0646\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 92, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064F \u0645\u064E\u0627 \u0645\u064E\u0646\u064E\u0639\u064E\u0643\u064E \u0625\u0650\u0630\u06E1 \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u0636\u064E\u0644\u0651\u064F\u0648\u0653\u0627\u0652" }, { id: 93, text: "\u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064E\u0646\u0650\u06D6 \u0623\u064E\u0641\u064E\u0639\u064E\u0635\u064E\u064A\u06E1\u062A\u064E \u0623\u064E\u0645\u06E1\u0631\u0650\u064A" }, { id: 94, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0628\u06E1\u0646\u064E\u0624\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u062E\u064F\u0630\u06E1 \u0628\u0650\u0644\u0650\u062D\u06E1\u064A\u064E\u062A\u0650\u064A \u0648\u064E\u0644\u064E\u0627 \u0628\u0650\u0631\u064E\u0623\u06E1\u0633\u0650\u064A\u0653\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A \u062E\u064E\u0634\u0650\u064A\u062A\u064F \u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064E \u0641\u064E\u0631\u0651\u064E\u0642\u06E1\u062A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u06E1\u0642\u064F\u0628\u06E1 \u0642\u064E\u0648\u06E1\u0644\u0650\u064A" }, { id: 95, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0645\u064E\u0627 \u062E\u064E\u0637\u06E1\u0628\u064F\u0643\u064E \u064A\u064E\u0670\u0633\u064E\u0670\u0645\u0650\u0631\u0650\u064A\u0651\u064F" }, { id: 96, text: "\u0642\u064E\u0627\u0644\u064E \u0628\u064E\u0635\u064F\u0631\u06E1\u062A\u064F \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0628\u06E1\u0635\u064F\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u0642\u064E\u0628\u064E\u0636\u06E1\u062A\u064F \u0642\u064E\u0628\u06E1\u0636\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u062B\u064E\u0631\u0650 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0641\u064E\u0646\u064E\u0628\u064E\u0630\u06E1\u062A\u064F\u0647\u064E\u0627 \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0633\u064E\u0648\u0651\u064E\u0644\u064E\u062A\u06E1 \u0644\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u0650\u064A" }, { id: 97, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0671\u0630\u06E1\u0647\u064E\u0628\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064E \u0644\u064E\u0627 \u0645\u0650\u0633\u064E\u0627\u0633\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0643\u064E \u0645\u064E\u0648\u06E1\u0639\u0650\u062F\u0657\u0627 \u0644\u0651\u064E\u0646 \u062A\u064F\u062E\u06E1\u0644\u064E\u0641\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0638\u064E\u0644\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0639\u064E\u0627\u0643\u0650\u0641\u0657\u0627\u06D6 \u0644\u0651\u064E\u0646\u064F\u062D\u064E\u0631\u0651\u0650\u0642\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0646\u064E\u0646\u0633\u0650\u0641\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u064A\u064E\u0645\u0651\u0650 \u0646\u064E\u0633\u06E1\u0641\u064B\u0627" }, { id: 98, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06DA \u0648\u064E\u0633\u0650\u0639\u064E \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u0650\u0644\u06E1\u0645\u0657\u0627" }, { id: 99, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u0642\u064F\u0635\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627 \u0642\u064E\u062F\u06E1 \u0633\u064E\u0628\u064E\u0642\u064E\u06DA \u0648\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064E \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0651\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u0657\u0627" }, { id: 100, text: "\u0645\u0651\u064E\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064E \u0639\u064E\u0646\u06E1\u0647\u064F \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0648\u0650\u0632\u06E1\u0631\u064B\u0627" }, { id: 101, text: "\u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u0650\u06D6 \u0648\u064E\u0633\u064E\u0627\u0653\u0621\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u062D\u0650\u0645\u06E1\u0644\u0657\u0627" }, { id: 102, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0646\u0641\u064E\u062E\u064F \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u0648\u0631\u0650\u06DA \u0648\u064E\u0646\u064E\u062D\u06E1\u0634\u064F\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0632\u064F\u0631\u06E1\u0642\u0657\u0627" }, { id: 103, text: "\u064A\u064E\u062A\u064E\u062E\u064E\u0670\u0641\u064E\u062A\u064F\u0648\u0646\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0644\u0651\u064E\u0628\u0650\u062B\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0634\u06E1\u0631\u0657\u0627" }, { id: 104, text: "\u0646\u0651\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0625\u0650\u0630\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0623\u064E\u0645\u06E1\u062B\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0637\u064E\u0631\u0650\u064A\u0642\u064E\u0629\u064B \u0625\u0650\u0646 \u0644\u0651\u064E\u0628\u0650\u062B\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u0657\u0627" }, { id: 105, text: "\u0648\u064E\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u0650 \u0641\u064E\u0642\u064F\u0644\u06E1 \u064A\u064E\u0646\u0633\u0650\u0641\u064F\u0647\u064E\u0627 \u0631\u064E\u0628\u0651\u0650\u064A \u0646\u064E\u0633\u06E1\u0641\u0657\u0627" }, { id: 106, text: "\u0641\u064E\u064A\u064E\u0630\u064E\u0631\u064F\u0647\u064E\u0627 \u0642\u064E\u0627\u0639\u0657\u0627 \u0635\u064E\u0641\u06E1\u0635\u064E\u0641\u0657\u0627" }, { id: 107, text: "\u0644\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0649\u0670 \u0641\u0650\u064A\u0647\u064E\u0627 \u0639\u0650\u0648\u064E\u062C\u0657\u0627 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u062A\u0657\u0627" }, { id: 108, text: "\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u062F\u0651\u064E\u0627\u0639\u0650\u064A\u064E \u0644\u064E\u0627 \u0639\u0650\u0648\u064E\u062C\u064E \u0644\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u062E\u064E\u0634\u064E\u0639\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0635\u06E1\u0648\u064E\u0627\u062A\u064F \u0644\u0650\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064E\u0645\u06E1\u0633\u0657\u0627" }, { id: 109, text: "\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u064E\u0627 \u062A\u064E\u0646\u0641\u064E\u0639\u064F \u0671\u0644\u0634\u0651\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0630\u0650\u0646\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0648\u064E\u0631\u064E\u0636\u0650\u064A\u064E \u0644\u064E\u0647\u064F\u06E5 \u0642\u064E\u0648\u06E1\u0644\u0657\u0627" }, { id: 110, text: "\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u06E1\u0641\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u064A\u0637\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u0657\u0627" }, { id: 111, text: "\u06DE\u0648\u064E\u0639\u064E\u0646\u064E\u062A\u0650 \u0671\u0644\u06E1\u0648\u064F\u062C\u064F\u0648\u0647\u064F \u0644\u0650\u0644\u06E1\u062D\u064E\u064A\u0651\u0650 \u0671\u0644\u06E1\u0642\u064E\u064A\u0651\u064F\u0648\u0645\u0650\u06D6 \u0648\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0627\u0628\u064E \u0645\u064E\u0646\u06E1 \u062D\u064E\u0645\u064E\u0644\u064E \u0638\u064F\u0644\u06E1\u0645\u0657\u0627" }, { id: 112, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u065E \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u062E\u064E\u0627\u0641\u064F \u0638\u064F\u0644\u06E1\u0645\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0647\u064E\u0636\u06E1\u0645\u0657\u0627" }, { id: 113, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064B\u0627 \u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0635\u064E\u0631\u0651\u064E\u0641\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0648\u064E\u0639\u0650\u064A\u062F\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E \u0623\u064E\u0648\u06E1 \u064A\u064F\u062D\u06E1\u062F\u0650\u062B\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0630\u0650\u0643\u06E1\u0631\u0657\u0627" }, { id: 114, text: "\u0641\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u0650\u0643\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06D7 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062C\u064E\u0644\u06E1 \u0628\u0650\u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064F\u0642\u06E1\u0636\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u062D\u06E1\u064A\u064F\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0642\u064F\u0644 \u0631\u0651\u064E\u0628\u0651\u0650 \u0632\u0650\u062F\u06E1\u0646\u0650\u064A \u0639\u0650\u0644\u06E1\u0645\u0657\u0627" }, { id: 115, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0647\u0650\u062F\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0641\u064E\u0646\u064E\u0633\u0650\u064A\u064E \u0648\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u062C\u0650\u062F\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0632\u06E1\u0645\u0657\u0627" }, { id: 116, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0671\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652 \u0644\u0650\u0623\u0653\u062F\u064E\u0645\u064E \u0641\u064E\u0633\u064E\u062C\u064E\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064E \u0623\u064E\u0628\u064E\u0649\u0670" }, { id: 117, text: "\u0641\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u064A\u064E\u0640\u0670\u0653\u0640\u0654\u064E\u0627\u062F\u064E\u0645\u064F \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0644\u0651\u064E\u0643\u064E \u0648\u064E\u0644\u0650\u0632\u064E\u0648\u06E1\u062C\u0650\u0643\u064E \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0641\u064E\u062A\u064E\u0634\u06E1\u0642\u064E\u0649\u0670\u0653" }, { id: 118, text: "\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0643\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u062C\u064F\u0648\u0639\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0631\u064E\u0649\u0670" }, { id: 119, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0627 \u062A\u064E\u0638\u06E1\u0645\u064E\u0624\u064F\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0636\u06E1\u062D\u064E\u0649\u0670" }, { id: 120, text: "\u0641\u064E\u0648\u064E\u0633\u06E1\u0648\u064E\u0633\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0640\u0670\u0653\u0640\u0654\u064E\u0627\u062F\u064E\u0645\u064F \u0647\u064E\u0644\u06E1 \u0623\u064E\u062F\u064F\u0644\u0651\u064F\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u062C\u064E\u0631\u064E\u0629\u0650 \u0671\u0644\u06E1\u062E\u064F\u0644\u06E1\u062F\u0650 \u0648\u064E\u0645\u064F\u0644\u06E1\u0643\u0656 \u0644\u0651\u064E\u0627 \u064A\u064E\u0628\u06E1\u0644\u064E\u0649\u0670" }, { id: 121, text: "\u0641\u064E\u0623\u064E\u0643\u064E\u0644\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0641\u064E\u0628\u064E\u062F\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u0645\u064E\u0627 \u0633\u064E\u0648\u06E1\u0621\u064E\u0670\u062A\u064F\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u0637\u064E\u0641\u0650\u0642\u064E\u0627 \u064A\u064E\u062E\u06E1\u0635\u0650\u0641\u064E\u0627\u0646\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064E\u0627 \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0642\u0650 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650\u06DA \u0648\u064E\u0639\u064E\u0635\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064F \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u0641\u064E\u063A\u064E\u0648\u064E\u0649\u0670" }, { id: 122, text: "\u062B\u064F\u0645\u0651\u064E \u0671\u062C\u06E1\u062A\u064E\u0628\u064E\u0670\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u06E5 \u0641\u064E\u062A\u064E\u0627\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0647\u064E\u062F\u064E\u0649\u0670" }, { id: 123, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0647\u06E1\u0628\u0650\u0637\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062C\u064E\u0645\u0650\u064A\u0639\u064E\u06E2\u0627\u06D6 \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645\u06E1 \u0644\u0650\u0628\u064E\u0639\u06E1\u0636\u064D \u0639\u064E\u062F\u064F\u0648\u0651\u065E\u06D6 \u0641\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u0651\u0650\u064A \u0647\u064F\u062F\u0657\u0649 \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0647\u064F\u062F\u064E\u0627\u064A\u064E \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0636\u0650\u0644\u0651\u064F \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0642\u064E\u0649\u0670" }, { id: 124, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064E \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650\u064A \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0639\u0650\u064A\u0634\u064E\u0629\u0657 \u0636\u064E\u0646\u0643\u0657\u0627 \u0648\u064E\u0646\u064E\u062D\u06E1\u0634\u064F\u0631\u064F\u0647\u064F\u06E5 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670" }, { id: 125, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0644\u0650\u0645\u064E \u062D\u064E\u0634\u064E\u0631\u06E1\u062A\u064E\u0646\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0643\u064F\u0646\u062A\u064F \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 126, text: "\u0642\u064E\u0627\u0644\u064E \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u062A\u064E\u062A\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0641\u064E\u0646\u064E\u0633\u0650\u064A\u062A\u064E\u0647\u064E\u0627\u06D6 \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064F\u0646\u0633\u064E\u0649\u0670" }, { id: 127, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0645\u064E\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0631\u064E\u0641\u064E \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u06E2 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0644\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0648\u064E\u0623\u064E\u0628\u06E1\u0642\u064E\u0649\u0670\u0653" }, { id: 128, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0647\u06E1\u062F\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064F\u0648\u0646\u0650 \u064A\u064E\u0645\u06E1\u0634\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0645\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u0650\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u0646\u0651\u064F\u0647\u064E\u0649\u0670" }, { id: 129, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u065E \u0633\u064E\u0628\u064E\u0642\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0632\u064E\u0627\u0645\u0657\u0627 \u0648\u064E\u0623\u064E\u062C\u064E\u0644\u065E \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649" }, { id: 130, text: "\u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0642\u064E\u0628\u06E1\u0644\u064E \u0637\u064F\u0644\u064F\u0648\u0639\u0650 \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u0650 \u0648\u064E\u0642\u064E\u0628\u06E1\u0644\u064E \u063A\u064F\u0631\u064F\u0648\u0628\u0650\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u0646\u064E\u0627\u0653\u064A\u0655\u0650 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0641\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0648\u064E\u0623\u064E\u0637\u06E1\u0631\u064E\u0627\u0641\u064E \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064E \u062A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670" }, { id: 131, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u064F\u062F\u0651\u064E\u0646\u0651\u064E \u0639\u064E\u064A\u06E1\u0646\u064E\u064A\u06E1\u0643\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0645\u064E\u062A\u0651\u064E\u0639\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0632\u064E\u0647\u06E1\u0631\u064E\u0629\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0644\u0650\u0646\u064E\u0641\u06E1\u062A\u0650\u0646\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650\u06DA \u0648\u064E\u0631\u0650\u0632\u06E1\u0642\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0648\u064E\u0623\u064E\u0628\u06E1\u0642\u064E\u0649\u0670" }, { id: 132, text: "\u0648\u064E\u0623\u06E1\u0645\u064F\u0631\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u064E \u0628\u0650\u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0671\u0635\u06E1\u0637\u064E\u0628\u0650\u0631\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06D6 \u0644\u064E\u0627 \u0646\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064E \u0631\u0650\u0632\u06E1\u0642\u0657\u0627\u06D6 \u0646\u0651\u064E\u062D\u06E1\u0646\u064F \u0646\u064E\u0631\u06E1\u0632\u064F\u0642\u064F\u0643\u064E\u06D7 \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0644\u0650\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670" }, { id: 133, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E\u0627 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u0653\u06DA \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0623\u06E1\u062A\u0650\u0647\u0650\u0645 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u062D\u064F\u0641\u0650 \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670" }, { id: 134, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0644\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u062A\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0641\u064E\u0646\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0643\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u0646\u0651\u064E\u0630\u0650\u0644\u0651\u064E \u0648\u064E\u0646\u064E\u062E\u06E1\u0632\u064E\u0649\u0670" }, { id: 135, text: "\u0642\u064F\u0644\u06E1 \u0643\u064F\u0644\u0651\u065E \u0645\u0651\u064F\u062A\u064E\u0631\u064E\u0628\u0651\u0650\u0635\u065E \u0641\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u064F\u0648\u0627\u0652\u06D6 \u0641\u064E\u0633\u064E\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0646\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0635\u0651\u0650\u0631\u064E\u0670\u0637\u0650 \u0671\u0644\u0633\u0651\u064E\u0648\u0650\u064A\u0651\u0650 \u0648\u064E\u0645\u064E\u0646\u0650 \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0649\u0670" }] }, { id: 21, name: "\u0627\u0644\u0623\u0646\u0628\u064A\u0627\u0621", transliteration: "Al-Anbya", type: "meccan", total_verses: 112, verses: [{ id: 1, text: "\u0671\u0642\u06E1\u062A\u064E\u0631\u064E\u0628\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u062D\u0650\u0633\u064E\u0627\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u063A\u064E\u0641\u06E1\u0644\u064E\u0629\u0656 \u0645\u0651\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 2, text: "\u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0630\u0650\u0643\u06E1\u0631\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u062D\u06E1\u062F\u064E\u062B\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0645\u064E\u0639\u064F\u0648\u0647\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0644\u06E1\u0639\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0644\u064E\u0627\u0647\u0650\u064A\u064E\u0629\u0657 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0623\u064E\u0633\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u062C\u06E1\u0648\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0647\u064E\u0644\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0623\u064E\u0641\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u0650\u062D\u06E1\u0631\u064E \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 5, text: "\u0628\u064E\u0644\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0636\u06E1\u063A\u064E\u0670\u062B\u064F \u0623\u064E\u062D\u06E1\u0644\u064E\u0670\u0645\u0650\u06ED \u0628\u064E\u0644\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F \u0628\u064E\u0644\u06E1 \u0647\u064F\u0648\u064E \u0634\u064E\u0627\u0639\u0650\u0631\u065E \u0641\u064E\u0644\u06E1\u064A\u064E\u0623\u06E1\u062A\u0650\u0646\u064E\u0627 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u0656 \u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u064E\u062A\u06E1 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064E\u0627\u0653\u06D6 \u0623\u064E\u0641\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u0650\u062C\u064E\u0627\u0644\u0657\u0627 \u0646\u0651\u064F\u0648\u062D\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0633\u064E\u062F\u0657\u0627 \u0644\u0651\u064E\u0627 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u0639\u064E\u0627\u0645\u064E \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u062B\u064F\u0645\u0651\u064E \u0635\u064E\u062F\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0648\u064E\u0639\u06E1\u062F\u064E \u0641\u064E\u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0646 \u0646\u0651\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 10, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627 \u0641\u0650\u064A\u0647\u0650 \u0630\u0650\u0643\u06E1\u0631\u064F\u0643\u064F\u0645\u06E1\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0643\u064E\u0645\u06E1 \u0642\u064E\u0635\u064E\u0645\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0656 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0638\u064E\u0627\u0644\u0650\u0645\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0646\u0634\u064E\u0623\u06E1\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u062F\u064E\u0647\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 12, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062D\u064E\u0633\u0651\u064F\u0648\u0627\u0652 \u0628\u064E\u0623\u06E1\u0633\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u064A\u064E\u0631\u06E1\u0643\u064F\u0636\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0644\u064E\u0627 \u062A\u064E\u0631\u06E1\u0643\u064F\u0636\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0623\u064F\u062A\u06E1\u0631\u0650\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0648\u064E\u064A\u06E1\u0644\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0638\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 15, text: "\u0641\u064E\u0645\u064E\u0627 \u0632\u064E\u0627\u0644\u064E\u062A \u062A\u0651\u0650\u0644\u06E1\u0643\u064E \u062F\u064E\u0639\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u062D\u064E\u0635\u0650\u064A\u062F\u064B\u0627 \u062E\u064E\u0670\u0645\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 16, text: "\u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0644\u064E\u0670\u0639\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u0644\u064E\u0648\u06E1 \u0623\u064E\u0631\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0644\u064E\u0647\u06E1\u0648\u0657\u0627 \u0644\u0651\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E\u0627 \u0641\u064E\u0670\u0639\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u0628\u064E\u0644\u06E1 \u0646\u064E\u0642\u06E1\u0630\u0650\u0641\u064F \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u0641\u064E\u064A\u064E\u062F\u06E1\u0645\u064E\u063A\u064F\u0647\u064F\u06E5 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0648\u064E \u0632\u064E\u0627\u0647\u0650\u0642\u065E\u06DA \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0648\u064E\u064A\u06E1\u0644\u064F \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0645\u064E\u0646\u06E1 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u062D\u06E1\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0646\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0644\u064E\u0627 \u064A\u064E\u0641\u06E1\u062A\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0623\u064E\u0645\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0634\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A\u0647\u0650\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0641\u064E\u0633\u064E\u062F\u064E\u062A\u064E\u0627\u06DA \u0641\u064E\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0644\u064E\u0627 \u064A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0623\u064E\u0645\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u0657\u06D6 \u0642\u064F\u0644\u06E1 \u0647\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0628\u064F\u0631\u06E1\u0647\u064E\u0670\u0646\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0647\u064E\u0670\u0630\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u064F \u0645\u064E\u0646 \u0645\u0651\u064E\u0639\u0650\u064A\u064E \u0648\u064E\u0630\u0650\u0643\u06E1\u0631\u064F \u0645\u064E\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u064A\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E\u06D6 \u0641\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064F\u0648\u062D\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u0650" }, { id: 26, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0648\u064E\u0644\u064E\u062F\u0657\u0627\u06D7 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5\u06DA \u0628\u064E\u0644\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u065E \u0645\u0651\u064F\u0643\u06E1\u0631\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0628\u0650\u0642\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u0648\u064E\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u06E1\u0641\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0641\u064E\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u0645\u064E\u0646\u0650 \u0671\u0631\u06E1\u062A\u064E\u0636\u064E\u0649\u0670 \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u0634\u06E1\u064A\u064E\u062A\u0650\u0647\u0650\u06E6 \u0645\u064F\u0634\u06E1\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u06DE\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0642\u064F\u0644\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0641\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A\u0647\u0650 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0643\u064E\u0627\u0646\u064E\u062A\u064E\u0627 \u0631\u064E\u062A\u06E1\u0642\u0657\u0627 \u0641\u064E\u0641\u064E\u062A\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064E\u0627\u06D6 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u0650 \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D \u062D\u064E\u064A\u0651\u064D\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0631\u064E\u0648\u064E\u0670\u0633\u0650\u064A\u064E \u0623\u064E\u0646 \u062A\u064E\u0645\u0650\u064A\u062F\u064E \u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u0650\u062C\u064E\u0627\u062C\u0657\u0627 \u0633\u064F\u0628\u064F\u0644\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0633\u064E\u0642\u06E1\u0641\u0657\u0627 \u0645\u0651\u064E\u062D\u06E1\u0641\u064F\u0648\u0638\u0657\u0627\u06D6 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u064E\u0627 \u0645\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E\u06D6 \u0643\u064F\u0644\u0651\u065E \u0641\u0650\u064A \u0641\u064E\u0644\u064E\u0643\u0656 \u064A\u064E\u0633\u06E1\u0628\u064E\u062D\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0628\u064E\u0634\u064E\u0631\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u062E\u064F\u0644\u06E1\u062F\u064E\u06D6 \u0623\u064E\u0641\u064E\u0625\u0650\u064A\u0652\u0646 \u0645\u0651\u0650\u062A\u0651\u064E \u0641\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0630\u064E\u0627\u0653\u0626\u0650\u0642\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650\u06D7 \u0648\u064E\u0646\u064E\u0628\u06E1\u0644\u064F\u0648\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u0634\u0651\u064E\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0657\u06D6 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0621\u064E\u0627\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0646\u064E\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0632\u064F\u0648\u064B\u0627 \u0623\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645 \u0628\u0650\u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0647\u064F\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u062E\u064F\u0644\u0650\u0642\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0645\u0650\u0646\u06E1 \u0639\u064E\u062C\u064E\u0644\u0656\u06DA \u0633\u064E\u0623\u064F\u0648\u0652\u0631\u0650\u064A\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u0650" }, { id: 38, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u062A\u064E\u0649\u0670 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0648\u064E\u0639\u06E1\u062F\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 39, text: "\u0644\u064E\u0648\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u062D\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0643\u064F\u0641\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646 \u0648\u064F\u062C\u064F\u0648\u0647\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0646 \u0638\u064F\u0647\u064F\u0648\u0631\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0628\u064E\u0644\u06E1 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645 \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657 \u0641\u064E\u062A\u064E\u0628\u06E1\u0647\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0631\u064E\u062F\u0651\u064E\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0638\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 41, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u0650 \u0671\u0633\u06E1\u062A\u064F\u0647\u06E1\u0632\u0650\u0626\u064E \u0628\u0650\u0631\u064F\u0633\u064F\u0644\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0641\u064E\u062D\u064E\u0627\u0642\u064E \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0633\u064E\u062E\u0650\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0644\u064E\u0624\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u065E \u062A\u064E\u0645\u06E1\u0646\u064E\u0639\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0646\u064E\u0627\u06DA \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0646\u064E\u0635\u06E1\u0631\u064E \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u064A\u064F\u0635\u06E1\u062D\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0628\u064E\u0644\u06E1 \u0645\u064E\u062A\u0651\u064E\u0639\u06E1\u0646\u064E\u0627 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0637\u064E\u0627\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0639\u064F\u0645\u064F\u0631\u064F\u06D7 \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0627 \u0646\u064E\u0623\u06E1\u062A\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0646\u064E\u0646\u0642\u064F\u0635\u064F\u0647\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0637\u06E1\u0631\u064E\u0627\u0641\u0650\u0647\u064E\u0627\u0653\u06DA \u0623\u064E\u0641\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0630\u0650\u0631\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0648\u064E\u062D\u06E1\u064A\u0650\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u0671\u0644\u0635\u0651\u064F\u0645\u0651\u064F \u0671\u0644\u062F\u0651\u064F\u0639\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627 \u064A\u064F\u0646\u0630\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0645\u0651\u064E\u0633\u0651\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0646\u064E\u0641\u06E1\u062D\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0646\u0651\u064E \u064A\u064E\u0670\u0648\u064E\u064A\u06E1\u0644\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0638\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0646\u064E\u0636\u064E\u0639\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u064E\u0670\u0632\u0650\u064A\u0646\u064E \u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u064E \u0644\u0650\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F \u0646\u064E\u0641\u06E1\u0633\u065E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u062B\u06E1\u0642\u064E\u0627\u0644\u064E \u062D\u064E\u0628\u0651\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u0631\u06E1\u062F\u064E\u0644\u064D \u0623\u064E\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u064E\u0627\u06D7 \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0646\u064E\u0627 \u062D\u064E\u0670\u0633\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0641\u064F\u0631\u06E1\u0642\u064E\u0627\u0646\u064E \u0648\u064E\u0636\u0650\u064A\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u0630\u0650\u0643\u06E1\u0631\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 49, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650 \u0645\u064F\u0634\u06E1\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u065E \u0645\u0651\u064F\u0628\u064E\u0627\u0631\u064E\u0643\u064C \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u06DA \u0623\u064E\u0641\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0646\u0643\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u06DE\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0631\u064F\u0634\u06E1\u062F\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 52, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0623\u064E\u0628\u0650\u064A\u0647\u0650 \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u062A\u0651\u064E\u0645\u064E\u0627\u062B\u0650\u064A\u0644\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064E\u0627 \u0639\u064E\u0670\u0643\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0644\u064E\u0647\u064E\u0627 \u0639\u064E\u0670\u0628\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 55, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062C\u0650\u0626\u06E1\u062A\u064E\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0623\u064E\u0645\u06E1 \u0623\u064E\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0640\u0670\u0639\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 56, text: "\u0642\u064E\u0627\u0644\u064E \u0628\u064E\u0644 \u0631\u0651\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u064E\u0637\u064E\u0631\u064E\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0639\u064E\u0644\u064E\u0649\u0670 \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 57, text: "\u0648\u064E\u062A\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0623\u064E\u0643\u0650\u064A\u062F\u064E\u0646\u0651\u064E \u0623\u064E\u0635\u06E1\u0646\u064E\u0670\u0645\u064E\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u062F\u064E \u0623\u064E\u0646 \u062A\u064F\u0648\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0645\u064F\u062F\u06E1\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 58, text: "\u0641\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064F\u0630\u064E\u0670\u0630\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0646 \u0641\u064E\u0639\u064E\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u0650\u0640\u0654\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 60, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0641\u064E\u062A\u0657\u0649 \u064A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0647\u064F\u0645\u06E1 \u064A\u064F\u0642\u064E\u0627\u0644\u064F \u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064F" }, { id: 61, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0623\u064E\u0646\u062A\u064E \u0641\u064E\u0639\u064E\u0644\u06E1\u062A\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u0650\u0640\u0654\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u0650\u0646\u064E\u0627 \u064A\u064E\u0640\u0670\u0653\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064F" }, { id: 63, text: "\u0642\u064E\u0627\u0644\u064E \u0628\u064E\u0644\u06E1 \u0641\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u06E5 \u0643\u064E\u0628\u0650\u064A\u0631\u064F\u0647\u064F\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0646\u0637\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0641\u064E\u0631\u064E\u062C\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u062B\u064F\u0645\u0651\u064E \u0646\u064F\u0643\u0650\u0633\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064F\u0621\u064F\u0648\u0633\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064E \u0645\u064E\u0627 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u064A\u064E\u0646\u0637\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0641\u064E\u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F\u0643\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0643\u064F\u0645\u06E1" }, { id: 67, text: "\u0623\u064F\u0641\u0651\u0656 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062D\u064E\u0631\u0651\u0650\u0642\u064F\u0648\u0647\u064F \u0648\u064E\u0671\u0646\u0635\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u064E\u0670\u0639\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 69, text: "\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u064A\u064E\u0670\u0646\u064E\u0627\u0631\u064F \u0643\u064F\u0648\u0646\u0650\u064A \u0628\u064E\u0631\u06E1\u062F\u0657\u0627 \u0648\u064E\u0633\u064E\u0644\u064E\u0670\u0645\u064B\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E" }, { id: 70, text: "\u0648\u064E\u0623\u064E\u0631\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0643\u064E\u064A\u06E1\u062F\u0657\u0627 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u062E\u06E1\u0633\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 71, text: "\u0648\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0644\u064F\u0648\u0637\u064B\u0627 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0628\u064E\u0670\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 72, text: "\u0648\u064E\u0648\u064E\u0647\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E \u0646\u064E\u0627\u0641\u0650\u0644\u064E\u0629\u0657\u06D6 \u0648\u064E\u0643\u064F\u0644\u0651\u0657\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0635\u064E\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 73, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0623\u064E\u0626\u0650\u0645\u0651\u064E\u0629\u0657 \u064A\u064E\u0647\u06E1\u062F\u064F\u0648\u0646\u064E \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0641\u0650\u0639\u06E1\u0644\u064E \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064E\u0670\u062A\u0650 \u0648\u064E\u0625\u0650\u0642\u064E\u0627\u0645\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0625\u0650\u064A\u062A\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u0650\u06D6 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0646\u064E\u0627 \u0639\u064E\u0670\u0628\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 74, text: "\u0648\u064E\u0644\u064F\u0648\u0637\u064B\u0627 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u062D\u064F\u0643\u06E1\u0645\u0657\u0627 \u0648\u064E\u0639\u0650\u0644\u06E1\u0645\u0657\u0627 \u0648\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064E\u0627\u0646\u064E\u062A \u062A\u0651\u064E\u0639\u06E1\u0645\u064E\u0644\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u064E\u0640\u0670\u0653\u0626\u0650\u062B\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064E \u0633\u064E\u0648\u06E1\u0621\u0656 \u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 75, text: "\u0648\u064E\u0623\u064E\u062F\u06E1\u062E\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 76, text: "\u0648\u064E\u0646\u064F\u0648\u062D\u064B\u0627 \u0625\u0650\u0630\u06E1 \u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0641\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0631\u06E1\u0628\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 77, text: "\u0648\u064E\u0646\u064E\u0635\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064E \u0633\u064E\u0648\u06E1\u0621\u0656 \u0641\u064E\u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 78, text: "\u0648\u064E\u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0648\u064E\u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0625\u0650\u0630\u06E1 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064E\u0627\u0646\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u0631\u06E1\u062B\u0650 \u0625\u0650\u0630\u06E1 \u0646\u064E\u0641\u064E\u0634\u064E\u062A\u06E1 \u0641\u0650\u064A\u0647\u0650 \u063A\u064E\u0646\u064E\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0644\u0650\u062D\u064F\u0643\u06E1\u0645\u0650\u0647\u0650\u0645\u06E1 \u0634\u064E\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 79, text: "\u0641\u064E\u0641\u064E\u0647\u0651\u064E\u0645\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u064B\u0627 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u062D\u064F\u0643\u06E1\u0645\u0657\u0627 \u0648\u064E\u0639\u0650\u0644\u06E1\u0645\u0657\u0627\u06DA \u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0645\u064E\u0639\u064E \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064E \u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u06E1\u0646\u064E \u0648\u064E\u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u064E\u06DA \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0641\u064E\u0670\u0639\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 80, text: "\u0648\u064E\u0639\u064E\u0644\u0651\u064E\u0645\u06E1\u0646\u064E\u0670\u0647\u064F \u0635\u064E\u0646\u06E1\u0639\u064E\u0629\u064E \u0644\u064E\u0628\u064F\u0648\u0633\u0656 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u0650\u062A\u064F\u062D\u06E1\u0635\u0650\u0646\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0623\u06E1\u0633\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0634\u064E\u0670\u0643\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0648\u064E\u0644\u0650\u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u064A\u062D\u064E \u0639\u064E\u0627\u0635\u0650\u0641\u064E\u0629\u0657 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0628\u064E\u0670\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 82, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u0650 \u0645\u064E\u0646 \u064A\u064E\u063A\u064F\u0648\u0635\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0645\u064E\u0644\u0657\u0627 \u062F\u064F\u0648\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u0670\u0641\u0650\u0638\u0650\u064A\u0646\u064E" }, { id: 83, text: "\u06DE\u0648\u064E\u0623\u064E\u064A\u0651\u064F\u0648\u0628\u064E \u0625\u0650\u0630\u06E1 \u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646\u0651\u0650\u064A \u0645\u064E\u0633\u0651\u064E\u0646\u0650\u064A\u064E \u0671\u0644\u0636\u0651\u064F\u0631\u0651\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u0623\u064E\u0631\u06E1\u062D\u064E\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u062D\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 84, text: "\u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0641\u064E\u0643\u064E\u0634\u064E\u0641\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0636\u064F\u0631\u0651\u0656\u06D6 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0645\u0650\u062B\u06E1\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0646\u064E\u0627 \u0648\u064E\u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u06E1\u0639\u064E\u0670\u0628\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 85, text: "\u0648\u064E\u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E \u0648\u064E\u0625\u0650\u062F\u06E1\u0631\u0650\u064A\u0633\u064E \u0648\u064E\u0630\u064E\u0627 \u0671\u0644\u06E1\u0643\u0650\u0641\u06E1\u0644\u0650\u06D6 \u0643\u064F\u0644\u0651\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 86, text: "\u0648\u064E\u0623\u064E\u062F\u06E1\u062E\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 87, text: "\u0648\u064E\u0630\u064E\u0627 \u0671\u0644\u0646\u0651\u064F\u0648\u0646\u0650 \u0625\u0650\u0630 \u0630\u0651\u064E\u0647\u064E\u0628\u064E \u0645\u064F\u063A\u064E\u0670\u0636\u0650\u0628\u0657\u0627 \u0641\u064E\u0638\u064E\u0646\u0651\u064E \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u0646\u0651\u064E\u0642\u06E1\u062F\u0650\u0631\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u064E\u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0641\u0650\u064A \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0623\u064E\u0646 \u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0643\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0643\u064F\u0646\u062A\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 88, text: "\u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0645\u0651\u0650\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u0640\u06E8\u062C\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 89, text: "\u0648\u064E\u0632\u064E\u0643\u064E\u0631\u0650\u064A\u0651\u064E\u0627\u0653 \u0625\u0650\u0630\u06E1 \u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u0631\u064E\u0628\u0651\u0650 \u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0631\u06E1\u0646\u0650\u064A \u0641\u064E\u0631\u06E1\u062F\u0657\u0627 \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u0648\u064E\u0670\u0631\u0650\u062B\u0650\u064A\u0646\u064E" }, { id: 90, text: "\u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0648\u064E\u0647\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u064A\u064E\u062D\u06E1\u064A\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0632\u064E\u0648\u06E1\u062C\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0633\u064E\u0670\u0631\u0650\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064E\u0670\u062A\u0650 \u0648\u064E\u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E\u0646\u064E\u0627 \u0631\u064E\u063A\u064E\u0628\u0657\u0627 \u0648\u064E\u0631\u064E\u0647\u064E\u0628\u0657\u0627\u06D6 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0646\u064E\u0627 \u062E\u064E\u0670\u0634\u0650\u0639\u0650\u064A\u0646\u064E" }, { id: 91, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u062D\u06E1\u0635\u064E\u0646\u064E\u062A\u06E1 \u0641\u064E\u0631\u06E1\u062C\u064E\u0647\u064E\u0627 \u0641\u064E\u0646\u064E\u0641\u064E\u062E\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0631\u0651\u064F\u0648\u062D\u0650\u0646\u064E\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0648\u064E\u0671\u0628\u06E1\u0646\u064E\u0647\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 92, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6\u0653 \u0623\u064F\u0645\u0651\u064E\u062A\u064F\u0643\u064F\u0645\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u0650" }, { id: 93, text: "\u0648\u064E\u062A\u064E\u0642\u064E\u0637\u0651\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0631\u064E\u0647\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0643\u064F\u0644\u0651\u064C \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0631\u064E\u0670\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 94, text: "\u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u065E \u0641\u064E\u0644\u064E\u0627 \u0643\u064F\u0641\u06E1\u0631\u064E\u0627\u0646\u064E \u0644\u0650\u0633\u064E\u0639\u06E1\u064A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0643\u064E\u0670\u062A\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 95, text: "\u0648\u064E\u062D\u064E\u0631\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064E\u0627\u0653 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 96, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0641\u064F\u062A\u0650\u062D\u064E\u062A\u06E1 \u064A\u064E\u0623\u06E1\u062C\u064F\u0648\u062C\u064F \u0648\u064E\u0645\u064E\u0623\u06E1\u062C\u064F\u0648\u062C\u064F \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u062D\u064E\u062F\u064E\u0628\u0656 \u064A\u064E\u0646\u0633\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u0648\u064E\u0671\u0642\u06E1\u062A\u064E\u0631\u064E\u0628\u064E \u0671\u0644\u06E1\u0648\u064E\u0639\u06E1\u062F\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u0650\u064A\u064E \u0634\u064E\u0670\u062E\u0650\u0635\u064E\u0629\u064C \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0648\u064E\u064A\u06E1\u0644\u064E\u0646\u064E\u0627 \u0642\u064E\u062F\u06E1 \u0643\u064F\u0646\u0651\u064E\u0627 \u0641\u0650\u064A \u063A\u064E\u0641\u06E1\u0644\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u064E\u0644\u06E1 \u0643\u064F\u0646\u0651\u064E\u0627 \u0638\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 98, text: "\u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0635\u064E\u0628\u064F \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0670\u0631\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 99, text: "\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u0657 \u0645\u0651\u064E\u0627 \u0648\u064E\u0631\u064E\u062F\u064F\u0648\u0647\u064E\u0627\u06D6 \u0648\u064E\u0643\u064F\u0644\u0651\u065E \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 100, text: "\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0632\u064E\u0641\u0650\u064A\u0631\u065E \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 101, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0633\u064E\u0628\u064E\u0642\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0645\u064F\u0628\u06E1\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 102, text: "\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u062D\u064E\u0633\u0650\u064A\u0633\u064E\u0647\u064E\u0627\u06D6 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0645\u064E\u0627 \u0671\u0634\u06E1\u062A\u064E\u0647\u064E\u062A\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0647\u064F\u0645\u06E1 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 103, text: "\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0632\u064F\u0646\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0632\u064E\u0639\u064F \u0671\u0644\u06E1\u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u0648\u064E\u062A\u064E\u062A\u064E\u0644\u064E\u0642\u0651\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0647\u064E\u0670\u0630\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 104, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u0637\u06E1\u0648\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0643\u064E\u0637\u064E\u064A\u0651\u0650 \u0671\u0644\u0633\u0651\u0650\u062C\u0650\u0644\u0651\u0650 \u0644\u0650\u0644\u06E1\u0643\u064F\u062A\u064F\u0628\u0650\u06DA \u0643\u064E\u0645\u064E\u0627 \u0628\u064E\u062F\u064E\u0623\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u062E\u064E\u0644\u06E1\u0642\u0656 \u0646\u0651\u064F\u0639\u0650\u064A\u062F\u064F\u0647\u064F\u06E5\u06DA \u0648\u064E\u0639\u06E1\u062F\u064B\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0641\u064E\u0670\u0639\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 105, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u062A\u064E\u0628\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0632\u0651\u064E\u0628\u064F\u0648\u0631\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u064A\u064E\u0631\u0650\u062B\u064F\u0647\u064E\u0627 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 106, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0628\u064E\u0644\u064E\u0670\u063A\u0657\u0627 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0670\u0628\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 107, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 108, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E\u06D6 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 109, text: "\u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0642\u064F\u0644\u06E1 \u0621\u064E\u0627\u0630\u064E\u0646\u062A\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0656\u06D6 \u0648\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u062F\u06E1\u0631\u0650\u064A\u0653 \u0623\u064E\u0642\u064E\u0631\u0650\u064A\u0628\u064C \u0623\u064E\u0645 \u0628\u064E\u0639\u0650\u064A\u062F\u065E \u0645\u0651\u064E\u0627 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 110, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u06E1\u062C\u064E\u0647\u06E1\u0631\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 111, text: "\u0648\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u062F\u06E1\u0631\u0650\u064A \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u06E5 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u062A\u064E\u0670\u0639\u064C \u0625\u0650\u0644\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 112, text: "\u0642\u064E\u0670\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u062D\u06E1\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D7 \u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0639\u064E\u0627\u0646\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u062A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }] }, { id: 22, name: "\u0627\u0644\u062D\u062C", transliteration: "Al-Hajj", type: "medinan", total_verses: 78, verses: [{ id: 1, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0632\u064E\u0644\u06E1\u0632\u064E\u0644\u064E\u0629\u064E \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650 \u0634\u064E\u064A\u06E1\u0621\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 2, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E\u0647\u064E\u0627 \u062A\u064E\u0630\u06E1\u0647\u064E\u0644\u064F \u0643\u064F\u0644\u0651\u064F \u0645\u064F\u0631\u06E1\u0636\u0650\u0639\u064E\u0629\u064D \u0639\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0636\u064E\u0639\u064E\u062A\u06E1 \u0648\u064E\u062A\u064E\u0636\u064E\u0639\u064F \u0643\u064F\u0644\u0651\u064F \u0630\u064E\u0627\u062A\u0650 \u062D\u064E\u0645\u06E1\u0644\u064D \u062D\u064E\u0645\u06E1\u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0633\u064F\u0643\u064E\u0670\u0631\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0628\u0650\u0633\u064F\u0643\u064E\u0670\u0631\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u062F\u0650\u064A\u062F\u065E" }, { id: 3, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F \u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u0656 \u0648\u064E\u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0656 \u0645\u0651\u064E\u0631\u0650\u064A\u062F\u0656" }, { id: 4, text: "\u0643\u064F\u062A\u0650\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0627\u0647\u064F \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0647\u064F\u06E5 \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0647\u0650 \u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u0633\u0651\u064E\u0639\u0650\u064A\u0631\u0650" }, { id: 5, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0631\u064E\u064A\u06E1\u0628\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u0639\u06E1\u062B\u0650 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062A\u064F\u0631\u064E\u0627\u0628\u0656 \u062B\u064F\u0645\u0651\u064E \u0645\u0650\u0646 \u0646\u0651\u064F\u0637\u06E1\u0641\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u0645\u0650\u0646\u06E1 \u0639\u064E\u0644\u064E\u0642\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u0645\u0650\u0646 \u0645\u0651\u064F\u0636\u06E1\u063A\u064E\u0629\u0656 \u0645\u0651\u064F\u062E\u064E\u0644\u0651\u064E\u0642\u064E\u0629\u0656 \u0648\u064E\u063A\u064E\u064A\u06E1\u0631\u0650 \u0645\u064F\u062E\u064E\u0644\u0651\u064E\u0642\u064E\u0629\u0656 \u0644\u0651\u0650\u0646\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0646\u064F\u0642\u0650\u0631\u0651\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u0650 \u0645\u064E\u0627 \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649 \u062B\u064F\u0645\u0651\u064E \u0646\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0643\u064F\u0645\u06E1 \u0637\u0650\u0641\u06E1\u0644\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0644\u0650\u062A\u064E\u0628\u06E1\u0644\u064F\u063A\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0634\u064F\u062F\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064F\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670 \u0648\u064E\u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064F\u0631\u064E\u062F\u0651\u064F \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0631\u06E1\u0630\u064E\u0644\u0650 \u0671\u0644\u06E1\u0639\u064F\u0645\u064F\u0631\u0650 \u0644\u0650\u0643\u064E\u064A\u06E1\u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0639\u0650\u0644\u06E1\u0645\u0656 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06DA \u0648\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0647\u064E\u0627\u0645\u0650\u062F\u064E\u0629\u0657 \u0641\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064E \u0671\u0647\u06E1\u062A\u064E\u0632\u0651\u064E\u062A\u06E1 \u0648\u064E\u0631\u064E\u0628\u064E\u062A\u06E1 \u0648\u064E\u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0632\u064E\u0648\u06E1\u062C\u0650\u06ED \u0628\u064E\u0647\u0650\u064A\u062C\u0656" }, { id: 6, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 7, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0621\u064E\u0627\u062A\u0650\u064A\u064E\u0629\u065E \u0644\u0651\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064F \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0628\u064F\u0648\u0631\u0650" }, { id: 8, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F \u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u0656 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0644\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u064F\u0646\u0650\u064A\u0631\u0656" }, { id: 9, text: "\u062B\u064E\u0627\u0646\u0650\u064A\u064E \u0639\u0650\u0637\u06E1\u0641\u0650\u0647\u0650\u06E6 \u0644\u0650\u064A\u064F\u0636\u0650\u0644\u0651\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062E\u0650\u0632\u06E1\u064A\u065E\u06D6 \u0648\u064E\u0646\u064F\u0630\u0650\u064A\u0642\u064F\u0647\u064F\u06E5 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u0650\u064A\u0642\u0650" }, { id: 10, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u064A\u064E\u062F\u064E\u0627\u0643\u064E \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u064A\u06E1\u0633\u064E \u0628\u0650\u0638\u064E\u0644\u0651\u064E\u0640\u0670\u0645\u0656 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0628\u0650\u064A\u062F\u0650" }, { id: 11, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u062D\u064E\u0631\u06E1\u0641\u0656\u06D6 \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064F\u06E5 \u062E\u064E\u064A\u06E1\u0631\u064C \u0671\u0637\u06E1\u0645\u064E\u0623\u064E\u0646\u0651\u064E \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u062A\u06E1\u0647\u064F \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u064C \u0671\u0646\u0642\u064E\u0644\u064E\u0628\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u062C\u06E1\u0647\u0650\u0647\u0650\u06E6 \u062E\u064E\u0633\u0650\u0631\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062E\u064F\u0633\u06E1\u0631\u064E\u0627\u0646\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 12, text: "\u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0647\u064F\u06E5 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F\u0647\u064F\u06E5\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u0636\u0651\u064E\u0644\u064E\u0670\u0644\u064F \u0671\u0644\u06E1\u0628\u064E\u0639\u0650\u064A\u062F\u064F" }, { id: 13, text: "\u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0645\u064E\u0646 \u0636\u064E\u0631\u0651\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F \u0645\u0650\u0646 \u0646\u0651\u064E\u0641\u06E1\u0639\u0650\u0647\u0650\u06E6\u06DA \u0644\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0639\u064E\u0634\u0650\u064A\u0631\u064F" }, { id: 14, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F" }, { id: 15, text: "\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0638\u064F\u0646\u0651\u064F \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u064A\u064E\u0646\u0635\u064F\u0631\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u0645\u06E1\u062F\u064F\u062F\u06E1 \u0628\u0650\u0633\u064E\u0628\u064E\u0628\u064D \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u062B\u064F\u0645\u0651\u064E \u0644\u06E1\u064A\u064E\u0642\u06E1\u0637\u064E\u0639\u06E1 \u0641\u064E\u0644\u06E1\u064A\u064E\u0646\u0638\u064F\u0631\u06E1 \u0647\u064E\u0644\u06E1 \u064A\u064F\u0630\u06E1\u0647\u0650\u0628\u064E\u0646\u0651\u064E \u0643\u064E\u064A\u06E1\u062F\u064F\u0647\u064F\u06E5 \u0645\u064E\u0627 \u064A\u064E\u063A\u0650\u064A\u0638\u064F" }, { id: 16, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u06ED \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064F\u0631\u0650\u064A\u062F\u064F" }, { id: 17, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0640\u0654\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0635\u064E\u0670\u0631\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u062C\u064F\u0648\u0633\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0641\u06E1\u0635\u0650\u0644\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u064C" }, { id: 18, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0633\u06E1\u062C\u064F\u062F\u064F\u06E4 \u0644\u064E\u0647\u064F\u06E5\u06E4 \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064F \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064F \u0648\u064E\u0671\u0644\u0646\u0651\u064F\u062C\u064F\u0648\u0645\u064F \u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u064F \u0648\u064E\u0671\u0644\u062F\u0651\u064E\u0648\u064E\u0627\u0653\u0628\u0651\u064F \u0648\u064E\u0643\u064E\u062B\u0650\u064A\u0631\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06D6 \u0648\u064E\u0643\u064E\u062B\u0650\u064A\u0631\u064C \u062D\u064E\u0642\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0647\u0650\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0645\u0651\u064F\u0643\u06E1\u0631\u0650\u0645\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06E9" }, { id: 19, text: "\u06DE\u0647\u064E\u0670\u0630\u064E\u0627\u0646\u0650 \u062E\u064E\u0635\u06E1\u0645\u064E\u0627\u0646\u0650 \u0671\u062E\u06E1\u062A\u064E\u0635\u064E\u0645\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0642\u064F\u0637\u0651\u0650\u0639\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u062B\u0650\u064A\u064E\u0627\u0628\u065E \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0627\u0631\u0656 \u064A\u064F\u0635\u064E\u0628\u0651\u064F \u0645\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650 \u0631\u064F\u0621\u064F\u0648\u0633\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u0645\u064F" }, { id: 20, text: "\u064A\u064F\u0635\u06E1\u0647\u064E\u0631\u064F \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u0641\u0650\u064A \u0628\u064F\u0637\u064F\u0648\u0646\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0671\u0644\u06E1\u062C\u064F\u0644\u064F\u0648\u062F\u064F" }, { id: 21, text: "\u0648\u064E\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0642\u064E\u0670\u0645\u0650\u0639\u064F \u0645\u0650\u0646\u06E1 \u062D\u064E\u062F\u0650\u064A\u062F\u0656" }, { id: 22, text: "\u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u0627\u062F\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0645\u0650\u0646\u06E1 \u063A\u064E\u0645\u0651\u064D \u0623\u064F\u0639\u0650\u064A\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u0650\u064A\u0642\u0650" }, { id: 23, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u064A\u064F\u062D\u064E\u0644\u0651\u064E\u0648\u06E1\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0633\u064E\u0627\u0648\u0650\u0631\u064E \u0645\u0650\u0646 \u0630\u064E\u0647\u064E\u0628\u0656 \u0648\u064E\u0644\u064F\u0624\u06E1\u0644\u064F\u0624\u0657\u0627\u06D6 \u0648\u064E\u0644\u0650\u0628\u064E\u0627\u0633\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062D\u064E\u0631\u0650\u064A\u0631\u065E" }, { id: 24, text: "\u0648\u064E\u0647\u064F\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u0648\u064E\u0647\u064F\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u062F\u0650" }, { id: 25, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064B \u0671\u0644\u06E1\u0639\u064E\u0670\u0643\u0650\u0641\u064F \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0627\u062F\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0631\u0650\u062F\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0628\u0650\u0625\u0650\u0644\u06E1\u062D\u064E\u0627\u062F\u0650\u06ED \u0628\u0650\u0638\u064F\u0644\u06E1\u0645\u0656 \u0646\u0651\u064F\u0630\u0650\u0642\u06E1\u0647\u064F \u0645\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 26, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0628\u064E\u0648\u0651\u064E\u0623\u06E1\u0646\u064E\u0627 \u0644\u0650\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0645\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u0650 \u0623\u064E\u0646 \u0644\u0651\u064E\u0627 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u06E1 \u0628\u0650\u064A \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0637\u064E\u0647\u0651\u0650\u0631\u06E1 \u0628\u064E\u064A\u06E1\u062A\u0650\u064A\u064E \u0644\u0650\u0644\u0637\u0651\u064E\u0627\u0653\u0626\u0650\u0641\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0627\u0653\u0626\u0650\u0645\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u0631\u0651\u064F\u0643\u0651\u064E\u0639\u0650 \u0671\u0644\u0633\u0651\u064F\u062C\u064F\u0648\u062F\u0650" }, { id: 27, text: "\u0648\u064E\u0623\u064E\u0630\u0651\u0650\u0646 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u062C\u0651\u0650 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0643\u064E \u0631\u0650\u062C\u064E\u0627\u0644\u0657\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0636\u064E\u0627\u0645\u0650\u0631\u0656 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0641\u064E\u062C\u0651\u064D \u0639\u064E\u0645\u0650\u064A\u0642\u0656" }, { id: 28, text: "\u0644\u0651\u0650\u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0646\u064E\u0670\u0641\u0650\u0639\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0633\u06E1\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u0650\u064A\u0653 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u064E\u0670\u062A\u064D \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0647\u0650\u064A\u0645\u064E\u0629\u0650 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650\u06D6 \u0641\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0637\u06E1\u0639\u0650\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0628\u064E\u0627\u0653\u0626\u0650\u0633\u064E \u0671\u0644\u06E1\u0641\u064E\u0642\u0650\u064A\u0631\u064E" }, { id: 29, text: "\u062B\u064F\u0645\u0651\u064E \u0644\u06E1\u064A\u064E\u0642\u06E1\u0636\u064F\u0648\u0627\u0652 \u062A\u064E\u0641\u064E\u062B\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u06E1\u064A\u064F\u0648\u0641\u064F\u0648\u0627\u0652 \u0646\u064F\u0630\u064F\u0648\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u06E1\u064A\u064E\u0637\u0651\u064E\u0648\u0651\u064E\u0641\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u0650 \u0671\u0644\u06E1\u0639\u064E\u062A\u0650\u064A\u0642\u0650" }, { id: 30, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0639\u064E\u0638\u0651\u0650\u0645\u06E1 \u062D\u064F\u0631\u064F\u0645\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0647\u064F\u06E5 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0623\u064F\u062D\u0650\u0644\u0651\u064E\u062A\u06E1 \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u064A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0671\u062C\u06E1\u062A\u064E\u0646\u0650\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u0650\u062C\u06E1\u0633\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u06E1\u062B\u064E\u0670\u0646\u0650 \u0648\u064E\u0671\u062C\u06E1\u062A\u064E\u0646\u0650\u0628\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0644\u064E \u0671\u0644\u0632\u0651\u064F\u0648\u0631\u0650" }, { id: 31, text: "\u062D\u064F\u0646\u064E\u0641\u064E\u0627\u0653\u0621\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0628\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u06E1 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u062E\u064E\u0631\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0641\u064E\u062A\u064E\u062E\u06E1\u0637\u064E\u0641\u064F\u0647\u064F \u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u064F \u0623\u064E\u0648\u06E1 \u062A\u064E\u0647\u06E1\u0648\u0650\u064A \u0628\u0650\u0647\u0650 \u0671\u0644\u0631\u0651\u0650\u064A\u062D\u064F \u0641\u0650\u064A \u0645\u064E\u0643\u064E\u0627\u0646\u0656 \u0633\u064E\u062D\u0650\u064A\u0642\u0656" }, { id: 32, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0639\u064E\u0638\u0651\u0650\u0645\u06E1 \u0634\u064E\u0639\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0645\u0650\u0646 \u062A\u064E\u0642\u06E1\u0648\u064E\u0649 \u0671\u0644\u06E1\u0642\u064F\u0644\u064F\u0648\u0628\u0650" }, { id: 33, text: "\u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0646\u064E\u0670\u0641\u0650\u0639\u064F \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649 \u062B\u064F\u0645\u0651\u064E \u0645\u064E\u062D\u0650\u0644\u0651\u064F\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u0650 \u0671\u0644\u06E1\u0639\u064E\u062A\u0650\u064A\u0642\u0650" }, { id: 34, text: "\u0648\u064E\u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0646\u0633\u064E\u0643\u0657\u0627 \u0644\u0651\u0650\u064A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0633\u06E1\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0647\u0650\u064A\u0645\u064E\u0629\u0650 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650\u06D7 \u0641\u064E\u0625\u0650\u0644\u064E\u0670\u0647\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E \u0641\u064E\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0628\u0650\u062A\u0650\u064A\u0646\u064E" }, { id: 35, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627 \u0630\u064F\u0643\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u062C\u0650\u0644\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0642\u0650\u064A\u0645\u0650\u064A \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0648\u064E\u0671\u0644\u06E1\u0628\u064F\u062F\u06E1\u0646\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u0639\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u064A\u06E1\u0631\u065E\u06D6 \u0641\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0633\u06E1\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0635\u064E\u0648\u064E\u0627\u0653\u0641\u0651\u064E\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0648\u064E\u062C\u064E\u0628\u064E\u062A\u06E1 \u062C\u064F\u0646\u064F\u0648\u0628\u064F\u0647\u064E\u0627 \u0641\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0637\u06E1\u0639\u0650\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0642\u064E\u0627\u0646\u0650\u0639\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0639\u06E1\u062A\u064E\u0631\u0651\u064E\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0633\u064E\u062E\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0644\u064E\u0646 \u064A\u064E\u0646\u064E\u0627\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064F\u062D\u064F\u0648\u0645\u064F\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062F\u0650\u0645\u064E\u0627\u0653\u0624\u064F\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u064A\u064E\u0646\u064E\u0627\u0644\u064F\u0647\u064F \u0671\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0633\u064E\u062E\u0651\u064E\u0631\u064E\u0647\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u0650\u062A\u064F\u0643\u064E\u0628\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0647\u064E\u062F\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062F\u064E\u0670\u0641\u0650\u0639\u064F \u0639\u064E\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0643\u064F\u0644\u0651\u064E \u062E\u064E\u0648\u0651\u064E\u0627\u0646\u0656 \u0643\u064E\u0641\u064F\u0648\u0631\u064D" }, { id: 39, text: "\u0623\u064F\u0630\u0650\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0642\u064E\u0670\u062A\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0638\u064F\u0644\u0650\u0645\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064E\u0635\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 40, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0647\u0650\u0645 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u064E\u0642\u0651\u064D \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D7 \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u062F\u064E\u0641\u06E1\u0639\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u0645 \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0644\u0651\u064E\u0647\u064F\u062F\u0651\u0650\u0645\u064E\u062A\u06E1 \u0635\u064E\u0648\u064E\u0670\u0645\u0650\u0639\u064F \u0648\u064E\u0628\u0650\u064A\u064E\u0639\u065E \u0648\u064E\u0635\u064E\u0644\u064E\u0648\u064E\u0670\u062A\u065E \u0648\u064E\u0645\u064E\u0633\u064E\u0670\u062C\u0650\u062F\u064F \u064A\u064F\u0630\u06E1\u0643\u064E\u0631\u064F \u0641\u0650\u064A\u0647\u064E\u0627 \u0671\u0633\u06E1\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627\u06D7 \u0648\u064E\u0644\u064E\u064A\u064E\u0646\u0635\u064F\u0631\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0646 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0642\u064E\u0648\u0650\u064A\u0651\u064C \u0639\u064E\u0632\u0650\u064A\u0632\u064C" }, { id: 41, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0646 \u0645\u0651\u064E\u0643\u0651\u064E\u0646\u0651\u064E\u0640\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0623\u064E\u0645\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0648\u064E\u0646\u064E\u0647\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650\u06D7 \u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u0650" }, { id: 42, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0643\u064E \u0641\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064F \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0639\u064E\u0627\u062F\u065E \u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064F" }, { id: 43, text: "\u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064F \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064F \u0644\u064F\u0648\u0637\u0656" }, { id: 44, text: "\u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0645\u064E\u062F\u06E1\u064A\u064E\u0646\u064E\u06D6 \u0648\u064E\u0643\u064F\u0630\u0651\u0650\u0628\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u06D6 \u0641\u064E\u0623\u064E\u0645\u06E1\u0644\u064E\u064A\u06E1\u062A\u064F \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0646\u064E\u0643\u0650\u064A\u0631\u0650" }, { id: 45, text: "\u0641\u064E\u0643\u064E\u0623\u064E\u064A\u0651\u0650\u0646 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0648\u064E\u0647\u0650\u064A\u064E \u0638\u064E\u0627\u0644\u0650\u0645\u064E\u0629\u065E \u0641\u064E\u0647\u0650\u064A\u064E \u062E\u064E\u0627\u0648\u0650\u064A\u064E\u0629\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064F\u0631\u064F\u0648\u0634\u0650\u0647\u064E\u0627 \u0648\u064E\u0628\u0650\u0626\u06E1\u0631\u0656 \u0645\u0651\u064F\u0639\u064E\u0637\u0651\u064E\u0644\u064E\u0629\u0656 \u0648\u064E\u0642\u064E\u0635\u06E1\u0631\u0656 \u0645\u0651\u064E\u0634\u0650\u064A\u062F\u064D" }, { id: 46, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u065E \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u065E \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627\u06D6 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u062A\u064E\u0639\u06E1\u0645\u064E\u0649 \u0671\u0644\u06E1\u0642\u064F\u0644\u064F\u0648\u0628\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 47, text: "\u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0648\u064E\u0644\u064E\u0646 \u064A\u064F\u062E\u06E1\u0644\u0650\u0641\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0639\u06E1\u062F\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u064A\u064E\u0648\u06E1\u0645\u064B\u0627 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0643\u064E\u0623\u064E\u0644\u06E1\u0641\u0650 \u0633\u064E\u0646\u064E\u0629\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u064F\u062F\u0651\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0643\u064E\u0623\u064E\u064A\u0651\u0650\u0646 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0623\u064E\u0645\u06E1\u0644\u064E\u064A\u06E1\u062A\u064F \u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0647\u0650\u064A\u064E \u0638\u064E\u0627\u0644\u0650\u0645\u064E\u0629\u065E \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0647\u064E\u0627 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 49, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 50, text: "\u0641\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0631\u0650\u0632\u06E1\u0642\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u065E" }, { id: 51, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0633\u064E\u0639\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0645\u064F\u0639\u064E\u0670\u062C\u0650\u0632\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 52, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0656 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0628\u0650\u064A\u0651\u064D \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u0645\u064E\u0646\u0651\u064E\u0649\u0670\u0653 \u0623\u064E\u0644\u06E1\u0642\u064E\u0649 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0641\u0650\u064A\u0653 \u0623\u064F\u0645\u06E1\u0646\u0650\u064A\u0651\u064E\u062A\u0650\u0647\u0650\u06E6 \u0641\u064E\u064A\u064E\u0646\u0633\u064E\u062E\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u064A\u064F\u0644\u06E1\u0642\u0650\u064A \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u062D\u06E1\u0643\u0650\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 53, text: "\u0644\u0651\u0650\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0645\u064E\u0627 \u064A\u064F\u0644\u06E1\u0642\u0650\u064A \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u065E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0627\u0633\u0650\u064A\u064E\u0629\u0650 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0644\u064E\u0641\u0650\u064A \u0634\u0650\u0642\u064E\u0627\u0642\u0650\u06ED \u0628\u064E\u0639\u0650\u064A\u062F\u0656" }, { id: 54, text: "\u0648\u064E\u0644\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u062A\u064F\u062E\u06E1\u0628\u0650\u062A\u064E \u0644\u064E\u0647\u064F\u06E5 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0647\u064E\u0627\u062F\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 55, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0632\u064E\u0627\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0645\u0650\u0631\u06E1\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064F \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0642\u0650\u064A\u0645\u064D" }, { id: 56, text: "\u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0641\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u0639\u0650\u064A\u0645\u0650" }, { id: 57, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u065E" }, { id: 58, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062C\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u0642\u064F\u062A\u0650\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1 \u0645\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0644\u064E\u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u0650\u0632\u06E1\u0642\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0632\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 59, text: "\u0644\u064E\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u062F\u06E1\u062E\u064E\u0644\u0657\u0627 \u064A\u064E\u0631\u06E1\u0636\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 60, text: "\u06DE\u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0639\u064E\u0627\u0642\u064E\u0628\u064E \u0628\u0650\u0645\u0650\u062B\u06E1\u0644\u0650 \u0645\u064E\u0627 \u0639\u064F\u0648\u0642\u0650\u0628\u064E \u0628\u0650\u0647\u0650\u06E6 \u062B\u064F\u0645\u0651\u064E \u0628\u064F\u063A\u0650\u064A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0644\u064E\u064A\u064E\u0646\u0635\u064F\u0631\u064E\u0646\u0651\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0639\u064E\u0641\u064F\u0648\u0651\u064C \u063A\u064E\u0641\u064F\u0648\u0631\u065E" }, { id: 61, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0648\u0644\u0650\u062C\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u064A\u064F\u0648\u0644\u0650\u062C\u064F \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064F\u06E2 \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 62, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0645\u064E\u0627 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u064F \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u0643\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 63, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u062A\u064F\u0635\u06E1\u0628\u0650\u062D\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0645\u064F\u062E\u06E1\u0636\u064E\u0631\u0651\u064E\u0629\u064B\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0637\u0650\u064A\u0641\u064C \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 64, text: "\u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0646\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u062F\u064F" }, { id: 65, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0645\u06E1\u0633\u0650\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0646 \u062A\u064E\u0642\u064E\u0639\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0631\u064E\u0621\u064F\u0648\u0641\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 66, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u062D\u06E1\u064A\u064E\u0627\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0645\u0650\u064A\u062A\u064F\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u062D\u06E1\u064A\u0650\u064A\u0643\u064F\u0645\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0644\u064E\u0643\u064E\u0641\u064F\u0648\u0631\u065E" }, { id: 67, text: "\u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0646\u0633\u064E\u0643\u064B\u0627 \u0647\u064F\u0645\u06E1 \u0646\u064E\u0627\u0633\u0650\u0643\u064F\u0648\u0647\u064F\u06D6 \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u0646\u064E\u0670\u0632\u0650\u0639\u064F\u0646\u0651\u064E\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650\u06DA \u0648\u064E\u0671\u062F\u06E1\u0639\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0647\u064F\u062F\u0657\u0649 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 68, text: "\u0648\u064E\u0625\u0650\u0646 \u062C\u064E\u0670\u062F\u064E\u0644\u064F\u0648\u0643\u064E \u0641\u064E\u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0641\u0650\u064A\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u062A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0633\u0650\u064A\u0631\u065E" }, { id: 71, text: "\u0648\u064E\u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u065E\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0644\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0646\u0651\u064E\u0635\u0650\u064A\u0631\u0656" }, { id: 72, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u062A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F \u0641\u0650\u064A \u0648\u064F\u062C\u064F\u0648\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u064E\u06D6 \u064A\u064E\u0643\u064E\u0627\u062F\u064F\u0648\u0646\u064E \u064A\u064E\u0633\u06E1\u0637\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u06D7 \u0642\u064F\u0644\u06E1 \u0623\u064E\u0641\u064E\u0623\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0634\u064E\u0631\u0651\u0656 \u0645\u0651\u0650\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F\u06DA \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0648\u064E\u0639\u064E\u062F\u064E\u0647\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 73, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0636\u064F\u0631\u0650\u0628\u064E \u0645\u064E\u062B\u064E\u0644\u065E \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0646 \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F\u0648\u0627\u0652 \u0630\u064F\u0628\u064E\u0627\u0628\u0657\u0627 \u0648\u064E\u0644\u064E\u0648\u0650 \u0671\u062C\u06E1\u062A\u064E\u0645\u064E\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0633\u06E1\u0644\u064F\u0628\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0630\u0651\u064F\u0628\u064E\u0627\u0628\u064F \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0646\u0642\u0650\u0630\u064F\u0648\u0647\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u06DA \u0636\u064E\u0639\u064F\u0641\u064E \u0671\u0644\u0637\u0651\u064E\u0627\u0644\u0650\u0628\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0637\u06E1\u0644\u064F\u0648\u0628\u064F" }, { id: 74, text: "\u0645\u064E\u0627 \u0642\u064E\u062F\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062D\u064E\u0642\u0651\u064E \u0642\u064E\u062F\u06E1\u0631\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0642\u064E\u0648\u0650\u064A\u0651\u064C \u0639\u064E\u0632\u0650\u064A\u0632\u064C" }, { id: 75, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0635\u06E1\u0637\u064E\u0641\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0631\u064F\u0633\u064F\u0644\u0657\u0627 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064F\u06E2 \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 76, text: "\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u06E1\u0641\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u064F" }, { id: 77, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0631\u06E1\u0643\u064E\u0639\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652\u06E4 \u0648\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E\u06E9" }, { id: 78, text: "\u0648\u064E\u062C\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u064E \u062C\u0650\u0647\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u06DA \u0647\u064F\u0648\u064E \u0671\u062C\u06E1\u062A\u064E\u0628\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0645\u0650\u0646\u06E1 \u062D\u064E\u0631\u064E\u062C\u0656\u06DA \u0645\u0651\u0650\u0644\u0651\u064E\u0629\u064E \u0623\u064E\u0628\u0650\u064A\u0643\u064F\u0645\u06E1 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E\u06DA \u0647\u064F\u0648\u064E \u0633\u064E\u0645\u0651\u064E\u0649\u0670\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0641\u0650\u064A \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u0650\u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0634\u064E\u0647\u0650\u064A\u062F\u064B\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06DA \u0641\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0671\u0639\u06E1\u062A\u064E\u0635\u0650\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0648\u064E \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0648\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u0646\u0651\u064E\u0635\u0650\u064A\u0631\u064F" }] }, { id: 23, name: "\u0627\u0644\u0645\u0624\u0645\u0646\u0648\u0646", transliteration: "Al-Mu'minun", type: "meccan", total_verses: 118, verses: [{ id: 1, text: "\u0642\u064E\u062F\u06E1 \u0623\u064E\u0641\u06E1\u0644\u064E\u062D\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 2, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0635\u064E\u0644\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u062E\u064E\u0670\u0634\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u063A\u06E1\u0648\u0650 \u0645\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0644\u0650\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u0650 \u0641\u064E\u0670\u0639\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0644\u0650\u0641\u064F\u0631\u064F\u0648\u062C\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u0670\u0641\u0650\u0638\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064E\u0644\u064F\u0648\u0645\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0628\u06E1\u062A\u064E\u063A\u064E\u0649\u0670 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0627\u062F\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0644\u0650\u0623\u064E\u0645\u064E\u0670\u0646\u064E\u0670\u062A\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0639\u064E\u0647\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0631\u064E\u0670\u0639\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0635\u064E\u0644\u064E\u0648\u064E\u0670\u062A\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u062D\u064E\u0627\u0641\u0650\u0638\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0648\u064E\u0670\u0631\u0650\u062B\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0631\u0650\u062B\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0641\u0650\u0631\u06E1\u062F\u064E\u0648\u06E1\u0633\u064E \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0645\u0650\u0646 \u0633\u064F\u0644\u064E\u0670\u0644\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0637\u0650\u064A\u0646\u0656" }, { id: 13, text: "\u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0646\u064F\u0637\u06E1\u0641\u064E\u0629\u0657 \u0641\u0650\u064A \u0642\u064E\u0631\u064E\u0627\u0631\u0656 \u0645\u0651\u064E\u0643\u0650\u064A\u0646\u0656" }, { id: 14, text: "\u062B\u064F\u0645\u0651\u064E \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0646\u0651\u064F\u0637\u06E1\u0641\u064E\u0629\u064E \u0639\u064E\u0644\u064E\u0642\u064E\u0629\u0657 \u0641\u064E\u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0639\u064E\u0644\u064E\u0642\u064E\u0629\u064E \u0645\u064F\u0636\u06E1\u063A\u064E\u0629\u0657 \u0641\u064E\u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0636\u06E1\u063A\u064E\u0629\u064E \u0639\u0650\u0638\u064E\u0670\u0645\u0657\u0627 \u0641\u064E\u0643\u064E\u0633\u064E\u0648\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0639\u0650\u0638\u064E\u0670\u0645\u064E \u0644\u064E\u062D\u06E1\u0645\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0646\u0634\u064E\u0623\u06E1\u0646\u064E\u0670\u0647\u064F \u062E\u064E\u0644\u06E1\u0642\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u064E\u06DA \u0641\u064E\u062A\u064E\u0628\u064E\u0627\u0631\u064E\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0644\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 15, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0645\u064E\u064A\u0651\u0650\u062A\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u062A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0641\u064E\u0648\u06E1\u0642\u064E\u0643\u064F\u0645\u06E1 \u0633\u064E\u0628\u06E1\u0639\u064E \u0637\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0642\u064E \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u0650 \u063A\u064E\u0670\u0641\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u064E\u06E2 \u0628\u0650\u0642\u064E\u062F\u064E\u0631\u0656 \u0641\u064E\u0623\u064E\u0633\u06E1\u0643\u064E\u0646\u0651\u064E\u0640\u0670\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0630\u064E\u0647\u064E\u0627\u0628\u0650\u06ED \u0628\u0650\u0647\u0650\u06E6 \u0644\u064E\u0642\u064E\u0670\u062F\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0641\u064E\u0623\u064E\u0646\u0634\u064E\u0623\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u062E\u0650\u064A\u0644\u0656 \u0648\u064E\u0623\u064E\u0639\u06E1\u0646\u064E\u0670\u0628\u0656 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u0648\u064E\u0670\u0643\u0650\u0647\u064F \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u065E \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u0634\u064E\u062C\u064E\u0631\u064E\u0629\u0657 \u062A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646 \u0637\u064F\u0648\u0631\u0650 \u0633\u064E\u064A\u06E1\u0646\u064E\u0627\u0653\u0621\u064E \u062A\u064E\u0646\u06E2\u0628\u064F\u062A\u064F \u0628\u0650\u0671\u0644\u062F\u0651\u064F\u0647\u06E1\u0646\u0650 \u0648\u064E\u0635\u0650\u0628\u06E1\u063A\u0656 \u0644\u0651\u0650\u0644\u06E1\u0623\u0653\u0643\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0644\u064E\u0639\u0650\u0628\u06E1\u0631\u064E\u0629\u0657\u06D6 \u0646\u0651\u064F\u0633\u06E1\u0642\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0641\u0650\u064A \u0628\u064F\u0637\u064F\u0648\u0646\u0650\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0646\u064E\u0670\u0641\u0650\u0639\u064F \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u065E \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u062A\u064F\u062D\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0646\u064F\u0648\u062D\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u063A\u064E\u064A\u06E1\u0631\u064F\u0647\u064F\u06E5\u0653\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0643\u064F\u0645\u06E1 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u064A\u064E\u062A\u064E\u0641\u064E\u0636\u0651\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0657 \u0645\u0651\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 25, text: "\u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u062C\u064F\u0644\u064F\u06E2 \u0628\u0650\u0647\u0650\u06E6 \u062C\u0650\u0646\u0651\u064E\u0629\u065E \u0641\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 26, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u0646\u0635\u064F\u0631\u06E1\u0646\u0650\u064A \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0646\u0650" }, { id: 27, text: "\u0641\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0646\u0650 \u0671\u0635\u06E1\u0646\u064E\u0639\u0650 \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064E \u0628\u0650\u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0650\u0646\u064E\u0627 \u0648\u064E\u0648\u064E\u062D\u06E1\u064A\u0650\u0646\u064E\u0627 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0631\u064F\u0646\u064E\u0627 \u0648\u064E\u0641\u064E\u0627\u0631\u064E \u0671\u0644\u062A\u0651\u064E\u0646\u0651\u064F\u0648\u0631\u064F \u0641\u064E\u0671\u0633\u06E1\u0644\u064F\u0643\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0656 \u0632\u064E\u0648\u06E1\u062C\u064E\u064A\u06E1\u0646\u0650 \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0633\u064E\u0628\u064E\u0642\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062E\u064E\u0670\u0637\u0650\u0628\u06E1\u0646\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u063A\u06E1\u0631\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u064A\u06E1\u062A\u064E \u0623\u064E\u0646\u062A\u064E \u0648\u064E\u0645\u064E\u0646 \u0645\u0651\u064E\u0639\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u0641\u064E\u0642\u064F\u0644\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0646\u064E\u062C\u0651\u064E\u0649\u0670\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 29, text: "\u0648\u064E\u0642\u064F\u0644 \u0631\u0651\u064E\u0628\u0651\u0650 \u0623\u064E\u0646\u0632\u0650\u0644\u06E1\u0646\u0650\u064A \u0645\u064F\u0646\u0632\u064E\u0644\u0657\u0627 \u0645\u0651\u064F\u0628\u064E\u0627\u0631\u064E\u0643\u0657\u0627 \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u0632\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064F\u0628\u06E1\u062A\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 31, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0646\u0634\u064E\u0623\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0631\u06E1\u0646\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u063A\u064E\u064A\u06E1\u0631\u064F\u0647\u064F\u06E5\u0653\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0644\u0650\u0642\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0623\u064E\u062A\u06E1\u0631\u064E\u0641\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0645\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0643\u064F\u0645\u06E1 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0648\u064E\u064A\u064E\u0634\u06E1\u0631\u064E\u0628\u064F \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0634\u06E1\u0631\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0637\u064E\u0639\u06E1\u062A\u064F\u0645 \u0628\u064E\u0634\u064E\u0631\u0657\u0627 \u0645\u0651\u0650\u062B\u06E1\u0644\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0623\u064E\u064A\u064E\u0639\u0650\u062F\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0645\u0650\u062A\u0651\u064F\u0645\u06E1 \u0648\u064E\u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0631\u064E\u0627\u0628\u0657\u0627 \u0648\u064E\u0639\u0650\u0638\u064E\u0670\u0645\u064B\u0627 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u064F\u062E\u06E1\u0631\u064E\u062C\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u06DE\u0647\u064E\u064A\u06E1\u0647\u064E\u0627\u062A\u064E \u0647\u064E\u064A\u06E1\u0647\u064E\u0627\u062A\u064E \u0644\u0650\u0645\u064E\u0627 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0625\u0650\u0646\u06E1 \u0647\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u062D\u064E\u064A\u064E\u0627\u062A\u064F\u0646\u064E\u0627 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0646\u064E\u0645\u064F\u0648\u062A\u064F \u0648\u064E\u0646\u064E\u062D\u06E1\u064A\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u0645\u064E\u0628\u06E1\u0639\u064F\u0648\u062B\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u062C\u064F\u0644\u064C \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u0657\u0627 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 39, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u0646\u0635\u064F\u0631\u06E1\u0646\u0650\u064A \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0646\u0650" }, { id: 40, text: "\u0642\u064E\u0627\u0644\u064E \u0639\u064E\u0645\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0656 \u0644\u0651\u064E\u064A\u064F\u0635\u06E1\u0628\u0650\u062D\u064F\u0646\u0651\u064E \u0646\u064E\u0670\u062F\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u062D\u064E\u0629\u064F \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u063A\u064F\u062B\u064E\u0627\u0653\u0621\u0657\u06DA \u0641\u064E\u0628\u064F\u0639\u06E1\u062F\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 42, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0646\u0634\u064E\u0623\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0642\u064F\u0631\u064F\u0648\u0646\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 43, text: "\u0645\u064E\u0627 \u062A\u064E\u0633\u06E1\u0628\u0650\u0642\u064F \u0645\u0650\u0646\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u064D \u0623\u064E\u062C\u064E\u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u062E\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0631\u064F\u0633\u064F\u0644\u064E\u0646\u064E\u0627 \u062A\u064E\u062A\u06E1\u0631\u064E\u0627\u06D6 \u0643\u064F\u0644\u0651\u064E \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064E\u0627 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F\u06D6 \u0641\u064E\u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u06E1\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0623\u064E\u062D\u064E\u0627\u062F\u0650\u064A\u062B\u064E\u06DA \u0641\u064E\u0628\u064F\u0639\u06E1\u062F\u0657\u0627 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u062E\u064E\u0627\u0647\u064F \u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 46, text: "\u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0645\u064E\u0644\u064E\u0625\u0650\u064A\u0652\u0647\u0650\u06E6 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064B\u0627 \u0639\u064E\u0627\u0644\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0644\u0650\u0628\u064E\u0634\u064E\u0631\u064E\u064A\u06E1\u0646\u0650 \u0645\u0650\u062B\u06E1\u0644\u0650\u0646\u064E\u0627 \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064F\u0647\u064F\u0645\u064E\u0627 \u0644\u064E\u0646\u064E\u0627 \u0639\u064E\u0670\u0628\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F\u0645\u064E\u0627 \u0641\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u0644\u064E\u0643\u0650\u064A\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0628\u06E1\u0646\u064E \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0648\u064E\u0623\u064F\u0645\u0651\u064E\u0647\u064F\u06E5\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0648\u064E\u0621\u064E\u0627\u0648\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u06E1\u0648\u064E\u0629\u0656 \u0630\u064E\u0627\u062A\u0650 \u0642\u064E\u0631\u064E\u0627\u0631\u0656 \u0648\u064E\u0645\u064E\u0639\u0650\u064A\u0646\u0656" }, { id: 51, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064F \u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0627\u0652 \u0635\u064E\u0670\u0644\u0650\u062D\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 52, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6\u0653 \u0623\u064F\u0645\u0651\u064E\u062A\u064F\u0643\u064F\u0645\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u0650" }, { id: 53, text: "\u0641\u064E\u062A\u064E\u0642\u064E\u0637\u0651\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0631\u064E\u0647\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0632\u064F\u0628\u064F\u0631\u0657\u0627\u06D6 \u0643\u064F\u0644\u0651\u064F \u062D\u0650\u0632\u06E1\u0628\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u062F\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0641\u064E\u0631\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u0641\u064E\u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u063A\u064E\u0645\u06E1\u0631\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u064D" }, { id: 55, text: "\u0623\u064E\u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u0646\u064F\u0645\u0650\u062F\u0651\u064F\u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0645\u0651\u064E\u0627\u0644\u0656 \u0648\u064E\u0628\u064E\u0646\u0650\u064A\u0646\u064E" }, { id: 56, text: "\u0646\u064F\u0633\u064E\u0627\u0631\u0650\u0639\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064E\u0670\u062A\u0650\u06DA \u0628\u064E\u0644 \u0644\u0651\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u0634\u06E1\u064A\u064E\u0629\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u0634\u06E1\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u062C\u0650\u0644\u064E\u0629\u064C \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0631\u064E\u0670\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 61, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064F\u0633\u064E\u0670\u0631\u0650\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064E\u0670\u062A\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064E\u0627 \u0633\u064E\u0670\u0628\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0648\u064E\u0644\u064E\u0627 \u0646\u064F\u0643\u064E\u0644\u0651\u0650\u0641\u064F \u0646\u064E\u0641\u06E1\u0633\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064F\u0633\u06E1\u0639\u064E\u0647\u064E\u0627\u06DA \u0648\u064E\u0644\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u065E \u064A\u064E\u0646\u0637\u0650\u0642\u064F \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0628\u064E\u0644\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u063A\u064E\u0645\u06E1\u0631\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u065E \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064E\u0627 \u0639\u064E\u0670\u0645\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u064F\u062A\u06E1\u0631\u064E\u0641\u0650\u064A\u0647\u0650\u0645 \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062C\u06E1\u0640\u0654\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0640\u0654\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0627 \u062A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u064E\u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0639\u06E1\u0642\u064E\u0670\u0628\u0650\u0643\u064F\u0645\u06E1 \u062A\u064E\u0646\u0643\u0650\u0635\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u0645\u064F\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u0650\u064A\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0633\u064E\u0670\u0645\u0650\u0631\u0657\u0627 \u062A\u064E\u0647\u06E1\u062C\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062F\u0651\u064E\u0628\u0651\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064E \u0623\u064E\u0645\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 69, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0648\u0627\u0652 \u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0646\u0643\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u062C\u0650\u0646\u0651\u064E\u0629\u064F\u06E2\u06DA \u0628\u064E\u0644\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u0650\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0643\u064E\u0670\u0631\u0650\u0647\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0648\u064E\u0644\u064E\u0648\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0641\u064E\u0633\u064E\u062F\u064E\u062A\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0648\u064E\u0645\u064E\u0646 \u0641\u0650\u064A\u0647\u0650\u0646\u0651\u064E\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0630\u0650\u0643\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0623\u064E\u0645\u06E1 \u062A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u062E\u064E\u0631\u06E1\u062C\u0657\u0627 \u0641\u064E\u062E\u064E\u0631\u064E\u0627\u062C\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u065E\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0632\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 73, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 74, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0639\u064E\u0646\u0650 \u0671\u0644\u0635\u0651\u0650\u0631\u064E\u0670\u0637\u0650 \u0644\u064E\u0646\u064E\u0670\u0643\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 75, text: "\u06DE\u0648\u064E\u0644\u064E\u0648\u06E1 \u0631\u064E\u062D\u0650\u0645\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0643\u064E\u0634\u064E\u0641\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0636\u064F\u0631\u0651\u0656 \u0644\u0651\u064E\u0644\u064E\u062C\u0651\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0637\u064F\u063A\u06E1\u064A\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0645\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0641\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062A\u064E\u0636\u064E\u0631\u0651\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 77, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0641\u064E\u062A\u064E\u062D\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u064E\u0627\u0628\u0657\u0627 \u0630\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u0656 \u0634\u064E\u062F\u0650\u064A\u062F\u064D \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0645\u064F\u0628\u06E1\u0644\u0650\u0633\u064F\u0648\u0646\u064E" }, { id: 78, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0634\u064E\u0623\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u0629\u064E\u06DA \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 79, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0630\u064E\u0631\u064E\u0623\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 80, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u064A\u064F\u0645\u0650\u064A\u062A\u064F \u0648\u064E\u0644\u064E\u0647\u064F \u0671\u062E\u06E1\u062A\u0650\u0644\u064E\u0670\u0641\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0628\u064E\u0644\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u062B\u06E1\u0644\u064E \u0645\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 82, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0645\u0650\u062A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u062A\u064F\u0631\u064E\u0627\u0628\u0657\u0627 \u0648\u064E\u0639\u0650\u0638\u064E\u0670\u0645\u064B\u0627 \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064E\u0628\u06E1\u0639\u064F\u0648\u062B\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0648\u064F\u0639\u0650\u062F\u06E1\u0646\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u064E\u0670\u0637\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 84, text: "\u0642\u064F\u0644 \u0644\u0651\u0650\u0645\u064E\u0646\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0648\u064E\u0645\u064E\u0646 \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 85, text: "\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0642\u064F\u0644\u06E1 \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 86, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646 \u0631\u0651\u064E\u0628\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u06E1\u0639\u0650 \u0648\u064E\u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 87, text: "\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0642\u064F\u0644\u06E1 \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 88, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646\u06E2 \u0628\u0650\u064A\u064E\u062F\u0650\u0647\u0650\u06E6 \u0645\u064E\u0644\u064E\u0643\u064F\u0648\u062A\u064F \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064F\u062C\u0650\u064A\u0631\u064F \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u062C\u064E\u0627\u0631\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 89, text: "\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0642\u064F\u0644\u06E1 \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u062A\u064F\u0633\u06E1\u062D\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 90, text: "\u0628\u064E\u0644\u06E1 \u0623\u064E\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 91, text: "\u0645\u064E\u0627 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0648\u064E\u0644\u064E\u062F\u0656 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D\u06DA \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0630\u064E\u0647\u064E\u0628\u064E \u0643\u064F\u0644\u0651\u064F \u0625\u0650\u0644\u064E\u0670\u0647\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 92, text: "\u0639\u064E\u0670\u0644\u0650\u0645\u0650 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650 \u0641\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649\u0670 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 93, text: "\u0642\u064F\u0644 \u0631\u0651\u064E\u0628\u0651\u0650 \u0625\u0650\u0645\u0651\u064E\u0627 \u062A\u064F\u0631\u0650\u064A\u064E\u0646\u0651\u0650\u064A \u0645\u064E\u0627 \u064A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 94, text: "\u0631\u064E\u0628\u0651\u0650 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 95, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u0646\u0651\u064F\u0631\u0650\u064A\u064E\u0643\u064E \u0645\u064E\u0627 \u0646\u064E\u0639\u0650\u062F\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0642\u064E\u0670\u062F\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 96, text: "\u0671\u062F\u06E1\u0641\u064E\u0639\u06E1 \u0628\u0650\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0647\u0650\u064A\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u064E\u06DA \u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u0648\u064E\u0642\u064F\u0644 \u0631\u0651\u064E\u0628\u0651\u0650 \u0623\u064E\u0639\u064F\u0648\u0630\u064F \u0628\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0647\u064E\u0645\u064E\u0632\u064E\u0670\u062A\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u0650" }, { id: 98, text: "\u0648\u064E\u0623\u064E\u0639\u064F\u0648\u0630\u064F \u0628\u0650\u0643\u064E \u0631\u064E\u0628\u0651\u0650 \u0623\u064E\u0646 \u064A\u064E\u062D\u06E1\u0636\u064F\u0631\u064F\u0648\u0646\u0650" }, { id: 99, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u062D\u064E\u062F\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u0650" }, { id: 100, text: "\u0644\u064E\u0639\u064E\u0644\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0645\u064E\u0644\u064F \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u0650\u064A\u0645\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u06E1\u062A\u064F\u06DA \u0643\u064E\u0644\u0651\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064C \u0647\u064F\u0648\u064E \u0642\u064E\u0627\u0653\u0626\u0650\u0644\u064F\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645 \u0628\u064E\u0631\u06E1\u0632\u064E\u062E\u064C \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u064A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0646\u064E" }, { id: 101, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0646\u064F\u0641\u0650\u062E\u064E \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u0648\u0631\u0650 \u0641\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u0633\u064E\u0627\u0628\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062A\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 102, text: "\u0641\u064E\u0645\u064E\u0646 \u062B\u064E\u0642\u064F\u0644\u064E\u062A\u06E1 \u0645\u064E\u0648\u064E\u0670\u0632\u0650\u064A\u0646\u064F\u0647\u064F\u06E5 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 103, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u062E\u064E\u0641\u0651\u064E\u062A\u06E1 \u0645\u064E\u0648\u064E\u0670\u0632\u0650\u064A\u0646\u064F\u0647\u064F\u06E5 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0633\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 104, text: "\u062A\u064E\u0644\u06E1\u0641\u064E\u062D\u064F \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0643\u064E\u0670\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 105, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u064E\u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 106, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u063A\u064E\u0644\u064E\u0628\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0634\u0650\u0642\u06E1\u0648\u064E\u062A\u064F\u0646\u064E\u0627 \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0636\u064E\u0627\u0653\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 107, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0631\u0650\u062C\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0641\u064E\u0625\u0650\u0646\u06E1 \u0639\u064F\u062F\u06E1\u0646\u064E\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0638\u064E\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 108, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u062E\u06E1\u0633\u064E\u0640\u0654\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064F\u0648\u0646\u0650" }, { id: 109, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0641\u064E\u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u0631\u06E1\u062D\u064E\u0645\u06E1\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u062D\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 110, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0633\u0650\u062E\u06E1\u0631\u0650\u064A\u0651\u064B\u0627 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0633\u064E\u0648\u06E1\u0643\u064F\u0645\u06E1 \u0630\u0650\u0643\u06E1\u0631\u0650\u064A \u0648\u064E\u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062A\u064E\u0636\u06E1\u062D\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 111, text: "\u0625\u0650\u0646\u0651\u0650\u064A \u062C\u064E\u0632\u064E\u064A\u06E1\u062A\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0628\u0650\u0645\u064E\u0627 \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0627\u0653\u0626\u0650\u0632\u064F\u0648\u0646\u064E" }, { id: 112, text: "\u0642\u064E\u0670\u0644\u064E \u0643\u064E\u0645\u06E1 \u0644\u064E\u0628\u0650\u062B\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0639\u064E\u062F\u064E\u062F\u064E \u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 113, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0628\u0650\u062B\u06E1\u0646\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0628\u064E\u0639\u06E1\u0636\u064E \u064A\u064E\u0648\u06E1\u0645\u0656 \u0641\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0627\u0653\u062F\u0651\u0650\u064A\u0646\u064E" }, { id: 114, text: "\u0642\u064E\u0670\u0644\u064E \u0625\u0650\u0646 \u0644\u0651\u064E\u0628\u0650\u062B\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627\u06D6 \u0644\u0651\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 115, text: "\u0623\u064E\u0641\u064E\u062D\u064E\u0633\u0650\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0639\u064E\u0628\u064E\u062B\u0657\u0627 \u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0644\u064E\u0627 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 116, text: "\u0641\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u0650\u0643\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06D6 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0671\u0644\u06E1\u0643\u064E\u0631\u0650\u064A\u0645\u0650" }, { id: 117, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062F\u06E1\u0639\u064F \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u064E \u0644\u064E\u0627 \u0628\u064F\u0631\u06E1\u0647\u064E\u0670\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062D\u0650\u0633\u064E\u0627\u0628\u064F\u0647\u064F\u06E5 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 118, text: "\u0648\u064E\u0642\u064F\u0644 \u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0648\u064E\u0671\u0631\u06E1\u062D\u064E\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u062D\u0650\u0645\u0650\u064A\u0646\u064E" }] }, { id: 24, name: "\u0627\u0644\u0646\u0648\u0631", transliteration: "An-Nur", type: "medinan", total_verses: 64, verses: [{ id: 1, text: "\u0633\u064F\u0648\u0631\u064E\u0629\u064C \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0648\u064E\u0641\u064E\u0631\u064E\u0636\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u06ED \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 2, text: "\u0671\u0644\u0632\u0651\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u064F \u0648\u064E\u0671\u0644\u0632\u0651\u064E\u0627\u0646\u0650\u064A \u0641\u064E\u0671\u062C\u06E1\u0644\u0650\u062F\u064F\u0648\u0627\u0652 \u0643\u064F\u0644\u0651\u064E \u0648\u064E\u0670\u062D\u0650\u062F\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0645\u0650\u0627\u0652\u0626\u064E\u0629\u064E \u062C\u064E\u0644\u06E1\u062F\u064E\u0629\u0656\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u062E\u064F\u0630\u06E1\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u0645\u064E\u0627 \u0631\u064E\u0623\u06E1\u0641\u064E\u0629\u065E \u0641\u0650\u064A \u062F\u0650\u064A\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u06D6 \u0648\u064E\u0644\u06E1\u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u064E\u0627 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 3, text: "\u0671\u0644\u0632\u0651\u064E\u0627\u0646\u0650\u064A \u0644\u064E\u0627 \u064A\u064E\u0646\u0643\u0650\u062D\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0632\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u064E\u0629\u0657 \u0648\u064E\u0671\u0644\u0632\u0651\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u064F \u0644\u064E\u0627 \u064A\u064E\u0646\u0643\u0650\u062D\u064F\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0632\u064E\u0627\u0646\u064D \u0623\u064E\u0648\u06E1 \u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u065E\u06DA \u0648\u064E\u062D\u064F\u0631\u0651\u0650\u0645\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 4, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0631\u06E1\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0635\u064E\u0646\u064E\u0670\u062A\u0650 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064E\u0629\u0650 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0671\u062C\u06E1\u0644\u0650\u062F\u064F\u0648\u0647\u064F\u0645\u06E1 \u062B\u064E\u0645\u064E\u0670\u0646\u0650\u064A\u0646\u064E \u062C\u064E\u0644\u06E1\u062F\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0628\u064E\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0634\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u064B \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06DA \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 6, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0631\u06E1\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064F \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0634\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u064F \u0623\u064E\u062D\u064E\u062F\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064F \u0634\u064E\u0647\u064E\u0670\u062F\u064E\u0670\u062A\u0650\u06ED \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0671\u0644\u06E1\u062E\u064E\u0670\u0645\u0650\u0633\u064E\u0629\u064F \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0639\u06E1\u0646\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u0648\u064E\u064A\u064E\u062F\u06E1\u0631\u064E\u0624\u064F\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0623\u064E\u0646 \u062A\u064E\u0634\u06E1\u0647\u064E\u062F\u064E \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064E \u0634\u064E\u0647\u064E\u0670\u062F\u064E\u0670\u062A\u0650\u06ED \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0671\u0644\u06E1\u062E\u064E\u0670\u0645\u0650\u0633\u064E\u0629\u064E \u0623\u064E\u0646\u0651\u064E \u063A\u064E\u0636\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064F\u0647\u064F\u06E5 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062A\u064E\u0648\u0651\u064E\u0627\u0628\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u064C" }, { id: 11, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062C\u064E\u0627\u0653\u0621\u064F\u0648 \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u0641\u06E1\u0643\u0650 \u0639\u064F\u0635\u06E1\u0628\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1\u06DA \u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0647\u064F \u0634\u064E\u0631\u0651\u0657\u0627 \u0644\u0651\u064E\u0643\u064F\u0645\u06D6 \u0628\u064E\u0644\u06E1 \u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06DA \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0671\u0645\u06E1\u0631\u0650\u064A\u0655\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0671\u0643\u06E1\u062A\u064E\u0633\u064E\u0628\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0643\u0650\u0628\u06E1\u0631\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 12, text: "\u0644\u0651\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0625\u0650\u0630\u06E1 \u0633\u064E\u0645\u0650\u0639\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F \u0638\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u064F \u0628\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0641\u06E1\u0643\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 13, text: "\u0644\u0651\u064E\u0648\u06E1\u0644\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064F\u0648 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0628\u0650\u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064E\u0629\u0650 \u0634\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064E\u06DA \u0641\u064E\u0625\u0650\u0630\u06E1 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0634\u0651\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u0650 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0644\u064E\u0645\u064E\u0633\u0651\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0645\u064E\u0627\u0653 \u0623\u064E\u0641\u064E\u0636\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u064C" }, { id: 15, text: "\u0625\u0650\u0630\u06E1 \u062A\u064E\u0644\u064E\u0642\u0651\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0628\u0650\u0623\u064E\u0644\u06E1\u0633\u0650\u0646\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0623\u064E\u0641\u06E1\u0648\u064E\u0627\u0647\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u065E \u0648\u064E\u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0647\u064E\u064A\u0651\u0650\u0646\u0657\u0627 \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 16, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0625\u0650\u0630\u06E1 \u0633\u064E\u0645\u0650\u0639\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F \u0642\u064F\u0644\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064E\u062A\u064E\u0643\u064E\u0644\u0651\u064E\u0645\u064E \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0643\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u064F\u0647\u06E1\u062A\u064E\u0670\u0646\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 17, text: "\u064A\u064E\u0639\u0650\u0638\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u062A\u064E\u0639\u064F\u0648\u062F\u064F\u0648\u0627\u0652 \u0644\u0650\u0645\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0628\u064E\u062F\u064B\u0627 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u064C" }, { id: 19, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u062A\u064E\u0634\u0650\u064A\u0639\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u064F \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064F\u0647\u064F\u06E5 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0621\u064F\u0648\u0641\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 21, text: "\u06DE\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u062E\u064F\u0637\u064F\u0648\u064E\u0670\u062A\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u062E\u064F\u0637\u064F\u0648\u064E\u0670\u062A\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F \u0628\u0650\u0671\u0644\u06E1\u0641\u064E\u062D\u06E1\u0634\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064F\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0632\u064E\u0643\u064E\u0649\u0670 \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u064D \u0623\u064E\u0628\u064E\u062F\u0657\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0632\u064E\u0643\u0651\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 22, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u064E\u0644\u0650 \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u0650 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0639\u064E\u0629\u0650 \u0623\u064E\u0646 \u064A\u064F\u0624\u06E1\u062A\u064F\u0648\u0653\u0627\u0652 \u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0647\u064E\u0670\u062C\u0650\u0631\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0644\u06E1\u064A\u064E\u0639\u06E1\u0641\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u06E1\u064A\u064E\u0635\u06E1\u0641\u064E\u062D\u064F\u0648\u0653\u0627\u0652\u06D7 \u0623\u064E\u0644\u064E\u0627 \u062A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 23, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0631\u06E1\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0635\u064E\u0646\u064E\u0670\u062A\u0650 \u0671\u0644\u06E1\u063A\u064E\u0670\u0641\u0650\u0644\u064E\u0670\u062A\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u0644\u064F\u0639\u0650\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 24, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u0644\u06E1\u0633\u0650\u0646\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064F\u0648\u064E\u0641\u0651\u0650\u064A\u0647\u0650\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062F\u0650\u064A\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 26, text: "\u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u064E\u0670\u062A\u064F \u0644\u0650\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u062B\u064E\u0670\u062A\u0650\u06D6 \u0648\u064E\u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u064F \u0644\u0650\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u064F\u0628\u064E\u0631\u0651\u064E\u0621\u064F\u0648\u0646\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E\u06D6 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0631\u0650\u0632\u06E1\u0642\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u065E" }, { id: 27, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0628\u064F\u064A\u064F\u0648\u062A\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E \u0628\u064F\u064A\u064F\u0648\u062A\u0650\u0643\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0633\u06E1\u062A\u064E\u0623\u06E1\u0646\u0650\u0633\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064F\u0633\u064E\u0644\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u064E\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u062D\u064E\u062F\u0657\u0627 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0647\u064E\u0627 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0624\u06E1\u0630\u064E\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0627\u0652 \u0641\u064E\u0671\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0627\u0652\u06D6 \u0647\u064F\u0648\u064E \u0623\u064E\u0632\u06E1\u0643\u064E\u0649\u0670 \u0644\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 29, text: "\u0644\u0651\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062C\u064F\u0646\u064E\u0627\u062D\u064C \u0623\u064E\u0646 \u062A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0628\u064F\u064A\u064F\u0648\u062A\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064E\u0633\u06E1\u0643\u064F\u0648\u0646\u064E\u0629\u0656 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u062A\u064E\u0670\u0639\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064F\u0628\u06E1\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u064A\u064E\u063A\u064F\u0636\u0651\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u062D\u06E1\u0641\u064E\u0638\u064F\u0648\u0627\u0652 \u0641\u064F\u0631\u064F\u0648\u062C\u064E\u0647\u064F\u0645\u06E1\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0632\u06E1\u0643\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0635\u06E1\u0646\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0648\u064E\u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u064A\u064E\u063A\u06E1\u0636\u064F\u0636\u06E1\u0646\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u064A\u064E\u062D\u06E1\u0641\u064E\u0638\u06E1\u0646\u064E \u0641\u064F\u0631\u064F\u0648\u062C\u064E\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0628\u06E1\u062F\u0650\u064A\u0646\u064E \u0632\u0650\u064A\u0646\u064E\u062A\u064E\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0638\u064E\u0647\u064E\u0631\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u06D6 \u0648\u064E\u0644\u06E1\u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u06E1\u0646\u064E \u0628\u0650\u062E\u064F\u0645\u064F\u0631\u0650\u0647\u0650\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u062C\u064F\u064A\u064F\u0648\u0628\u0650\u0647\u0650\u0646\u0651\u064E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0628\u06E1\u062F\u0650\u064A\u0646\u064E \u0632\u0650\u064A\u0646\u064E\u062A\u064E\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u0628\u064F\u0639\u064F\u0648\u0644\u064E\u062A\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u0650 \u0628\u064F\u0639\u064F\u0648\u0644\u064E\u062A\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1 \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1 \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u0650 \u0628\u064F\u0639\u064F\u0648\u0644\u064E\u062A\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1 \u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1 \u0628\u064E\u0646\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0648\u064E\u0670\u062A\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1 \u0646\u0650\u0633\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1 \u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0647\u064F\u0646\u0651\u064E \u0623\u064E\u0648\u0650 \u0671\u0644\u062A\u0651\u064E\u0640\u0670\u0628\u0650\u0639\u0650\u064A\u0646\u064E \u063A\u064E\u064A\u06E1\u0631\u0650 \u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0625\u0650\u0631\u06E1\u0628\u064E\u0629\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u062C\u064E\u0627\u0644\u0650 \u0623\u064E\u0648\u0650 \u0671\u0644\u0637\u0651\u0650\u0641\u06E1\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0638\u06E1\u0647\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u0648\u06E1\u0631\u064E\u0670\u062A\u0650 \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u06E1\u0646\u064E \u0628\u0650\u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u0650\u0647\u0650\u0646\u0651\u064E \u0644\u0650\u064A\u064F\u0639\u06E1\u0644\u064E\u0645\u064E \u0645\u064E\u0627 \u064A\u064F\u062E\u06E1\u0641\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0632\u0650\u064A\u0646\u064E\u062A\u0650\u0647\u0650\u0646\u0651\u064E\u06DA \u0648\u064E\u062A\u064F\u0648\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627 \u0623\u064E\u064A\u0651\u064F\u0647\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u0648\u064E\u0623\u064E\u0646\u0643\u0650\u062D\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u064A\u064E\u0670\u0645\u064E\u0649\u0670 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0645\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0641\u064F\u0642\u064E\u0631\u064E\u0627\u0653\u0621\u064E \u064A\u064F\u063A\u06E1\u0646\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0670\u0633\u0650\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 33, text: "\u0648\u064E\u0644\u06E1\u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u0641\u0650\u0641\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0646\u0650\u0643\u064E\u0627\u062D\u064B\u0627 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0643\u064E\u0627\u062A\u0650\u0628\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627\u06D6 \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0627\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0643\u06E1\u0631\u0650\u0647\u064F\u0648\u0627\u0652 \u0641\u064E\u062A\u064E\u064A\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0628\u0650\u063A\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u062F\u06E1\u0646\u064E \u062A\u064E\u062D\u064E\u0635\u0651\u064F\u0646\u0657\u0627 \u0644\u0651\u0650\u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0639\u064E\u0631\u064E\u0636\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0643\u06E1\u0631\u0650\u0647\u0647\u0651\u064F\u0646\u0651\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0625\u0650\u0643\u06E1\u0631\u064E\u0670\u0647\u0650\u0647\u0650\u0646\u0651\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 34, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0656 \u0645\u0651\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0648\u064E\u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0644\u064E\u0648\u06E1\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0648\u06E1\u0639\u0650\u0638\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 35, text: "\u06DE\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0646\u064F\u0648\u0631\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0645\u064E\u062B\u064E\u0644\u064F \u0646\u064F\u0648\u0631\u0650\u0647\u0650\u06E6 \u0643\u064E\u0645\u0650\u0634\u06E1\u0643\u064E\u0648\u0670\u0629\u0656 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0635\u06E1\u0628\u064E\u0627\u062D\u064C\u06D6 \u0671\u0644\u06E1\u0645\u0650\u0635\u06E1\u0628\u064E\u0627\u062D\u064F \u0641\u0650\u064A \u0632\u064F\u062C\u064E\u0627\u062C\u064E\u0629\u064D\u06D6 \u0671\u0644\u0632\u0651\u064F\u062C\u064E\u0627\u062C\u064E\u0629\u064F \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064E\u0627 \u0643\u064E\u0648\u06E1\u0643\u064E\u0628\u065E \u062F\u064F\u0631\u0651\u0650\u064A\u0651\u065E \u064A\u064F\u0648\u0642\u064E\u062F\u064F \u0645\u0650\u0646 \u0634\u064E\u062C\u064E\u0631\u064E\u0629\u0656 \u0645\u0651\u064F\u0628\u064E\u0670\u0631\u064E\u0643\u064E\u0629\u0656 \u0632\u064E\u064A\u06E1\u062A\u064F\u0648\u0646\u064E\u0629\u0656 \u0644\u0651\u064E\u0627 \u0634\u064E\u0631\u06E1\u0642\u0650\u064A\u0651\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u0627 \u063A\u064E\u0631\u06E1\u0628\u0650\u064A\u0651\u064E\u0629\u0656 \u064A\u064E\u0643\u064E\u0627\u062F\u064F \u0632\u064E\u064A\u06E1\u062A\u064F\u0647\u064E\u0627 \u064A\u064F\u0636\u0650\u064A\u0653\u0621\u064F \u0648\u064E\u0644\u064E\u0648\u06E1 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0645\u06E1\u0633\u064E\u0633\u06E1\u0647\u064F \u0646\u064E\u0627\u0631\u065E\u06DA \u0646\u0651\u064F\u0648\u0631\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064F\u0648\u0631\u0656\u06DA \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u0646\u064F\u0648\u0631\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 36, text: "\u0641\u0650\u064A \u0628\u064F\u064A\u064F\u0648\u062A\u064D \u0623\u064E\u0630\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u062A\u064F\u0631\u06E1\u0641\u064E\u0639\u064E \u0648\u064E\u064A\u064F\u0630\u06E1\u0643\u064E\u0631\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0671\u0633\u06E1\u0645\u064F\u0647\u064F\u06E5 \u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A\u0647\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u063A\u064F\u062F\u064F\u0648\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u0635\u064E\u0627\u0644\u0650" }, { id: 37, text: "\u0631\u0650\u062C\u064E\u0627\u0644\u065E \u0644\u0651\u064E\u0627 \u062A\u064F\u0644\u06E1\u0647\u0650\u064A\u0647\u0650\u0645\u06E1 \u062A\u0650\u062C\u064E\u0670\u0631\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0627 \u0628\u064E\u064A\u06E1\u0639\u064C \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0625\u0650\u0642\u064E\u0627\u0645\u0650 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u0625\u0650\u064A\u062A\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u0650 \u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u064A\u064E\u0648\u06E1\u0645\u0657\u0627 \u062A\u064E\u062A\u064E\u0642\u064E\u0644\u0651\u064E\u0628\u064F \u0641\u0650\u064A\u0647\u0650 \u0671\u0644\u06E1\u0642\u064F\u0644\u064F\u0648\u0628\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F" }, { id: 38, text: "\u0644\u0650\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u0632\u0650\u064A\u062F\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u0650\u0633\u064E\u0627\u0628\u0656" }, { id: 39, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0643\u064E\u0633\u064E\u0631\u064E\u0627\u0628\u0650\u06ED \u0628\u0650\u0642\u0650\u064A\u0639\u064E\u0629\u0656 \u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0647\u064F \u0671\u0644\u0638\u0651\u064E\u0645\u06E1\u0640\u0654\u064E\u0627\u0646\u064F \u0645\u064E\u0627\u0653\u0621\u064B \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u06E5 \u0644\u064E\u0645\u06E1 \u064A\u064E\u062C\u0650\u062F\u06E1\u0647\u064F \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0648\u064E\u062C\u064E\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0641\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670\u0647\u064F \u062D\u0650\u0633\u064E\u0627\u0628\u064E\u0647\u064F\u06E5\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0631\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 40, text: "\u0623\u064E\u0648\u06E1 \u0643\u064E\u0638\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0656 \u0641\u0650\u064A \u0628\u064E\u062D\u06E1\u0631\u0656 \u0644\u0651\u064F\u062C\u0651\u0650\u064A\u0651\u0656 \u064A\u064E\u063A\u06E1\u0634\u064E\u0649\u0670\u0647\u064F \u0645\u064E\u0648\u06E1\u062C\u065E \u0645\u0651\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u0650\u06E6 \u0645\u064E\u0648\u06E1\u062C\u065E \u0645\u0651\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u0650\u06E6 \u0633\u064E\u062D\u064E\u0627\u0628\u065E\u06DA \u0638\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u064F\u06E2 \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064E\u0627 \u0641\u064E\u0648\u06E1\u0642\u064E \u0628\u064E\u0639\u06E1\u0636\u064D \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u064A\u064E\u062F\u064E\u0647\u064F\u06E5 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064E\u062F\u06E1 \u064A\u064E\u0631\u064E\u0649\u0670\u0647\u064E\u0627\u06D7 \u0648\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u06E5 \u0646\u064F\u0648\u0631\u0657\u0627 \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0646\u0651\u064F\u0648\u0631\u064D" }, { id: 41, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u064F \u0635\u064E\u0640\u0670\u0653\u0641\u0651\u064E\u0640\u0670\u062A\u0656\u06D6 \u0643\u064F\u0644\u0651\u065E \u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u064E \u0635\u064E\u0644\u064E\u0627\u062A\u064E\u0647\u064F\u06E5 \u0648\u064E\u062A\u064E\u0633\u06E1\u0628\u0650\u064A\u062D\u064E\u0647\u064F\u06E5\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 43, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0632\u06E1\u062C\u0650\u064A \u0633\u064E\u062D\u064E\u0627\u0628\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0624\u064E\u0644\u0651\u0650\u0641\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0647\u064F\u06E5 \u0631\u064F\u0643\u064E\u0627\u0645\u0657\u0627 \u0641\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0648\u064E\u062F\u06E1\u0642\u064E \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646\u06E1 \u062E\u0650\u0644\u064E\u0670\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u0650\u0646 \u062C\u0650\u0628\u064E\u0627\u0644\u0656 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0631\u064E\u062F\u0656 \u0641\u064E\u064A\u064F\u0635\u0650\u064A\u0628\u064F \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0635\u06E1\u0631\u0650\u0641\u064F\u0647\u064F\u06E5 \u0639\u064E\u0646 \u0645\u0651\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u064A\u064E\u0643\u064E\u0627\u062F\u064F \u0633\u064E\u0646\u064E\u0627 \u0628\u064E\u0631\u06E1\u0642\u0650\u0647\u0650\u06E6 \u064A\u064E\u0630\u06E1\u0647\u064E\u0628\u064F \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650" }, { id: 44, text: "\u064A\u064F\u0642\u064E\u0644\u0651\u0650\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0639\u0650\u0628\u06E1\u0631\u064E\u0629\u0657 \u0644\u0651\u0650\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650" }, { id: 45, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u0644\u064E\u0642\u064E \u0643\u064F\u0644\u0651\u064E \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0627\u0653\u0621\u0656\u06D6 \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0645\u06E1\u0634\u0650\u064A \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0637\u06E1\u0646\u0650\u0647\u0650\u06E6 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0645\u06E1\u0634\u0650\u064A \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u0650\u062C\u06E1\u0644\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0645\u06E1\u0634\u0650\u064A \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u0656\u06DA \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 46, text: "\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0656 \u0645\u0651\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 47, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0628\u0650\u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0648\u064E\u0623\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062F\u064F\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0644\u0650\u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064F\u0630\u06E1\u0639\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0623\u064E\u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u064C \u0623\u064E\u0645\u0650 \u0671\u0631\u06E1\u062A\u064E\u0627\u0628\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1 \u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u062D\u0650\u064A\u0641\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0642\u064E\u0648\u06E1\u0644\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627 \u062F\u064F\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0644\u0650\u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627\u06DA \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0637\u0650\u0639\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u064A\u064E\u062E\u06E1\u0634\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u064A\u064E\u062A\u0651\u064E\u0642\u06E1\u0647\u0650 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0627\u0653\u0626\u0650\u0632\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u06DE\u0648\u064E\u0623\u064E\u0642\u06E1\u0633\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0647\u06E1\u062F\u064E \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0645\u064E\u0631\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0646\u0651\u064E\u06D6 \u0642\u064F\u0644 \u0644\u0651\u064E\u0627 \u062A\u064F\u0642\u06E1\u0633\u0650\u0645\u064F\u0648\u0627\u0652\u06D6 \u0637\u064E\u0627\u0639\u064E\u0629\u065E \u0645\u0651\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u064E\u0629\u064C\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E\u06D6 \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0627 \u062D\u064F\u0645\u0651\u0650\u0644\u064E \u0648\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u062D\u064F\u0645\u0651\u0650\u0644\u06E1\u062A\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0637\u0650\u064A\u0639\u064F\u0648\u0647\u064F \u062A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 55, text: "\u0648\u064E\u0639\u064E\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0644\u0650\u0641\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0643\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u062E\u06E1\u0644\u064E\u0641\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u064A\u064F\u0645\u064E\u0643\u0651\u0650\u0646\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062F\u0650\u064A\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0671\u0631\u06E1\u062A\u064E\u0636\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u064A\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u062E\u064E\u0648\u06E1\u0641\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0646\u0657\u0627\u06DA \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E\u0646\u0650\u064A \u0644\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E \u0628\u0650\u064A \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0631\u06E1\u062D\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F\u06D6 \u0648\u064E\u0644\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 58, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u0650\u0646\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0628\u06E1\u0644\u064F\u063A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064F\u0644\u064F\u0645\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u062B\u064E\u0644\u064E\u0670\u062B\u064E \u0645\u064E\u0631\u0651\u064E\u0640\u0670\u062A\u0656\u06DA \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0635\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u06E1\u0641\u064E\u062C\u06E1\u0631\u0650 \u0648\u064E\u062D\u0650\u064A\u0646\u064E \u062A\u064E\u0636\u064E\u0639\u064F\u0648\u0646\u064E \u062B\u0650\u064A\u064E\u0627\u0628\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0647\u0650\u064A\u0631\u064E\u0629\u0650 \u0648\u064E\u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0635\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u06E1\u0639\u0650\u0634\u064E\u0627\u0653\u0621\u0650\u06DA \u062B\u064E\u0644\u064E\u0670\u062B\u064F \u0639\u064E\u0648\u06E1\u0631\u064E\u0670\u062A\u0656 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1\u06DA \u0644\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062C\u064F\u0646\u064E\u0627\u062D\u064F\u06E2 \u0628\u064E\u0639\u06E1\u062F\u064E\u0647\u064F\u0646\u0651\u064E\u06DA \u0637\u064E\u0648\u0651\u064E\u0640\u0670\u0641\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 59, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E \u0671\u0644\u06E1\u0623\u064E\u0637\u06E1\u0641\u064E\u0670\u0644\u064F \u0645\u0650\u0646\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064F\u0644\u064F\u0645\u064E \u0641\u064E\u0644\u06E1\u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u0650\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u064E\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 60, text: "\u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0648\u064E\u0670\u0639\u0650\u062F\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0651\u064E\u0640\u0670\u062A\u0650\u064A \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0646\u0650\u0643\u064E\u0627\u062D\u0657\u0627 \u0641\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u062C\u064F\u0646\u064E\u0627\u062D\u064C \u0623\u064E\u0646 \u064A\u064E\u0636\u064E\u0639\u06E1\u0646\u064E \u062B\u0650\u064A\u064E\u0627\u0628\u064E\u0647\u064F\u0646\u0651\u064E \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064F\u062A\u064E\u0628\u064E\u0631\u0651\u0650\u062C\u064E\u0670\u062A\u0650\u06ED \u0628\u0650\u0632\u0650\u064A\u0646\u064E\u0629\u0656\u06D6 \u0648\u064E\u0623\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u0641\u0650\u0641\u06E1\u0646\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0647\u064F\u0646\u0651\u064E\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 61, text: "\u0644\u0651\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670 \u062D\u064E\u0631\u064E\u062C\u065E \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u062C\u0650 \u062D\u064E\u0631\u064E\u062C\u065E \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0631\u0650\u064A\u0636\u0650 \u062D\u064E\u0631\u064E\u062C\u065E \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064F\u064A\u064F\u0648\u062A\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0628\u064F\u064A\u064F\u0648\u062A\u0650 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0628\u064F\u064A\u064F\u0648\u062A\u0650 \u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0628\u064F\u064A\u064F\u0648\u062A\u0650 \u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0628\u064F\u064A\u064F\u0648\u062A\u0650 \u0623\u064E\u062E\u064E\u0648\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0628\u064F\u064A\u064F\u0648\u062A\u0650 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0645\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0628\u064F\u064A\u064F\u0648\u062A\u0650 \u0639\u064E\u0645\u0651\u064E\u0640\u0670\u062A\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0628\u064F\u064A\u064F\u0648\u062A\u0650 \u0623\u064E\u062E\u06E1\u0648\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0628\u064F\u064A\u064F\u0648\u062A\u0650 \u062E\u064E\u0670\u0644\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0641\u064E\u0627\u062A\u0650\u062D\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0648\u06E1 \u0635\u064E\u062F\u0650\u064A\u0642\u0650\u0643\u064F\u0645\u06E1\u06DA \u0644\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062C\u064F\u0646\u064E\u0627\u062D\u064C \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0634\u06E1\u062A\u064E\u0627\u062A\u0657\u0627\u06DA \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062F\u064E\u062E\u064E\u0644\u06E1\u062A\u064F\u0645 \u0628\u064F\u064A\u064F\u0648\u062A\u0657\u0627 \u0641\u064E\u0633\u064E\u0644\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u062A\u064E\u062D\u0650\u064A\u0651\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0628\u064E\u0670\u0631\u064E\u0643\u064E\u0629\u0657 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0629\u0657\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0631\u0656 \u062C\u064E\u0627\u0645\u0650\u0639\u0656 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0630\u06E1\u0647\u064E\u0628\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u0650\u0646\u064F\u0648\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u0650\u0646\u064F\u0648\u0646\u064E\u0643\u064E \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6\u06DA \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u064E\u0646\u064F\u0648\u0643\u064E \u0644\u0650\u0628\u064E\u0639\u06E1\u0636\u0650 \u0634\u064E\u0623\u06E1\u0646\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u06E1\u0630\u064E\u0646 \u0644\u0651\u0650\u0645\u064E\u0646 \u0634\u0650\u0626\u06E1\u062A\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 63, text: "\u0644\u0651\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u062F\u064F\u0639\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0643\u064E\u062F\u064F\u0639\u064E\u0627\u0653\u0621\u0650 \u0628\u064E\u0639\u06E1\u0636\u0650\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u0657\u0627\u06DA \u0642\u064E\u062F\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u064E\u0633\u064E\u0644\u0651\u064E\u0644\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0644\u0650\u0648\u064E\u0627\u0630\u0657\u0627\u06DA \u0641\u064E\u0644\u06E1\u064A\u064E\u062D\u06E1\u0630\u064E\u0631\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062E\u064E\u0627\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646 \u062A\u064F\u0635\u0650\u064A\u0628\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u064C \u0623\u064E\u0648\u06E1 \u064A\u064F\u0635\u0650\u064A\u0628\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 64, text: "\u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0642\u064E\u062F\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u064E\u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2" }] }, { id: 25, name: "\u0627\u0644\u0641\u0631\u0642\u0627\u0646", transliteration: "Al-Furqan", type: "meccan", total_verses: 77, verses: [{ id: 1, text: "\u062A\u064E\u0628\u064E\u0627\u0631\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0671\u0644\u06E1\u0641\u064F\u0631\u06E1\u0642\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u0628\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0644\u0650\u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E \u0646\u064E\u0630\u0650\u064A\u0631\u064B\u0627" }, { id: 2, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u06E1 \u0648\u064E\u0644\u064E\u062F\u0657\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0634\u064E\u0631\u0650\u064A\u0643\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u0650 \u0648\u064E\u062E\u064E\u0644\u064E\u0642\u064E \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0642\u064E\u062F\u0651\u064E\u0631\u064E\u0647\u064F\u06E5 \u062A\u064E\u0642\u06E1\u062F\u0650\u064A\u0631\u0657\u0627" }, { id: 3, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u0657 \u0644\u0651\u064E\u0627 \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F\u0648\u0646\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u062E\u06E1\u0644\u064E\u0642\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0644\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0636\u064E\u0631\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0641\u06E1\u0639\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0645\u064E\u0648\u06E1\u062A\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u0646\u064F\u0634\u064F\u0648\u0631\u0657\u0627" }, { id: 4, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0641\u06E1\u0643\u064C \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u0639\u064E\u0627\u0646\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0642\u064E\u0648\u06E1\u0645\u064C \u0621\u064E\u0627\u062E\u064E\u0631\u064F\u0648\u0646\u064E\u06D6 \u0641\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064F\u0648 \u0638\u064F\u0644\u06E1\u0645\u0657\u0627 \u0648\u064E\u0632\u064F\u0648\u0631\u0657\u0627" }, { id: 5, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0633\u064E\u0670\u0637\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E \u0671\u0643\u06E1\u062A\u064E\u062A\u064E\u0628\u064E\u0647\u064E\u0627 \u0641\u064E\u0647\u0650\u064A\u064E \u062A\u064F\u0645\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0628\u064F\u0643\u06E1\u0631\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0635\u0650\u064A\u0644\u0657\u0627" }, { id: 6, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u0633\u0651\u0650\u0631\u0651\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 7, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0644\u0650 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F \u0671\u0644\u0637\u0651\u064E\u0639\u064E\u0627\u0645\u064E \u0648\u064E\u064A\u064E\u0645\u06E1\u0634\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0648\u064E\u0627\u0642\u0650 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0644\u064E\u0643\u065E \u0641\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0646\u064E\u0630\u0650\u064A\u0631\u064B\u0627" }, { id: 8, text: "\u0623\u064E\u0648\u06E1 \u064A\u064F\u0644\u06E1\u0642\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0643\u064E\u0646\u0632\u064C \u0623\u064E\u0648\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u062C\u064E\u0646\u0651\u064E\u0629\u065E \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u06DA \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0625\u0650\u0646 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u062C\u064F\u0644\u0657\u0627 \u0645\u0651\u064E\u0633\u06E1\u062D\u064F\u0648\u0631\u064B\u0627" }, { id: 9, text: "\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0636\u064E\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u064E \u0641\u064E\u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 10, text: "\u062A\u064E\u0628\u064E\u0627\u0631\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0643\u064E \u0642\u064F\u0635\u064F\u0648\u0631\u064E\u06E2\u0627" }, { id: 11, text: "\u0628\u064E\u0644\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650\u06D6 \u0648\u064E\u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u0650\u0645\u064E\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0628\u0650\u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650 \u0633\u064E\u0639\u0650\u064A\u0631\u064B\u0627" }, { id: 12, text: "\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u062A\u06E1\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u0650\u06ED \u0628\u064E\u0639\u0650\u064A\u062F\u0656 \u0633\u064E\u0645\u0650\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064E\u0627 \u062A\u064E\u063A\u064E\u064A\u0651\u064F\u0638\u0657\u0627 \u0648\u064E\u0632\u064E\u0641\u0650\u064A\u0631\u0657\u0627" }, { id: 13, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064F\u0644\u06E1\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0645\u064E\u0643\u064E\u0627\u0646\u0657\u0627 \u0636\u064E\u064A\u0651\u0650\u0642\u0657\u0627 \u0645\u0651\u064F\u0642\u064E\u0631\u0651\u064E\u0646\u0650\u064A\u0646\u064E \u062F\u064E\u0639\u064E\u0648\u06E1\u0627\u0652 \u0647\u064F\u0646\u064E\u0627\u0644\u0650\u0643\u064E \u062B\u064F\u0628\u064F\u0648\u0631\u0657\u0627" }, { id: 14, text: "\u0644\u0651\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u062B\u064F\u0628\u064F\u0648\u0631\u0657\u0627 \u0648\u064E\u0670\u062D\u0650\u062F\u0657\u0627 \u0648\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u062B\u064F\u0628\u064F\u0648\u0631\u0657\u0627 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627" }, { id: 15, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u064C \u0623\u064E\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0629\u064F \u0671\u0644\u06E1\u062E\u064F\u0644\u06E1\u062F\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0648\u064F\u0639\u0650\u062F\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E\u06DA \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u0645\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 16, text: "\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u0648\u0646\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E\u06DA \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0648\u064E\u0639\u06E1\u062F\u0657\u0627 \u0645\u0651\u064E\u0633\u06E1\u0640\u0654\u064F\u0648\u0644\u0657\u0627" }, { id: 17, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u062D\u06E1\u0634\u064F\u0631\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0621\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0636\u06E1\u0644\u064E\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u0645\u06E1 \u0647\u064F\u0645\u06E1 \u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u064E" }, { id: 18, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0643\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0646\u06E2\u0628\u064E\u063A\u0650\u064A \u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0645\u0651\u064E\u062A\u0651\u064E\u0639\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0646\u064E\u0633\u064F\u0648\u0627\u0652 \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064E\u06E2\u0627 \u0628\u064F\u0648\u0631\u0657\u0627" }, { id: 19, text: "\u0641\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0641\u064E\u0645\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0635\u064E\u0631\u06E1\u0641\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u06E1\u0631\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0646\u064F\u0630\u0650\u0642\u06E1\u0647\u064F \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 20, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u0639\u064E\u0627\u0645\u064E \u0648\u064E\u064A\u064E\u0645\u06E1\u0634\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0648\u064E\u0627\u0642\u0650\u06D7 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064E\u0643\u064F\u0645\u06E1 \u0644\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u064B \u0623\u064E\u062A\u064E\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 21, text: "\u06DE\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0623\u064E\u0648\u06E1 \u0646\u064E\u0631\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u06D7 \u0644\u064E\u0642\u064E\u062F\u0650 \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0639\u064E\u062A\u064E\u0648\u06E1 \u0639\u064F\u062A\u064F\u0648\u0651\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 22, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064E \u0644\u064E\u0627 \u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u062D\u0650\u062C\u06E1\u0631\u0657\u0627 \u0645\u0651\u064E\u062D\u06E1\u062C\u064F\u0648\u0631\u0657\u0627" }, { id: 23, text: "\u0648\u064E\u0642\u064E\u062F\u0650\u0645\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0639\u064E\u0645\u064E\u0644\u0656 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0647\u064E\u0628\u064E\u0627\u0653\u0621\u0657 \u0645\u0651\u064E\u0646\u062B\u064F\u0648\u0631\u064B\u0627" }, { id: 24, text: "\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u0657\u0627 \u0648\u064E\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0645\u064E\u0642\u0650\u064A\u0644\u0657\u0627" }, { id: 25, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0634\u064E\u0642\u0651\u064E\u0642\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u0645\u064E\u0670\u0645\u0650 \u0648\u064E\u0646\u064F\u0632\u0651\u0650\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u062A\u064E\u0646\u0632\u0650\u064A\u0644\u064B\u0627" }, { id: 26, text: "\u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0644\u0650\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0648\u06E1\u0645\u064B\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0633\u0650\u064A\u0631\u0657\u0627" }, { id: 27, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0639\u064E\u0636\u0651\u064F \u0671\u0644\u0638\u0651\u064E\u0627\u0644\u0650\u0645\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064F \u0645\u064E\u0639\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 28, text: "\u064A\u064E\u0670\u0648\u064E\u064A\u06E1\u0644\u064E\u062A\u064E\u0649\u0670 \u0644\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0644\u064E\u0645\u06E1 \u0623\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u06E1 \u0641\u064F\u0644\u064E\u0627\u0646\u064B\u0627 \u062E\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 29, text: "\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064E\u0646\u0650\u064A \u0639\u064E\u0646\u0650 \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0646\u0650\u064A\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0644\u0650\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u0650 \u062E\u064E\u0630\u064F\u0648\u0644\u0657\u0627" }, { id: 30, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u064A\u064E\u0670\u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u064E \u0642\u064E\u0648\u06E1\u0645\u0650\u064A \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0645\u064E\u0647\u06E1\u062C\u064F\u0648\u0631\u0657\u0627" }, { id: 31, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0646\u064E\u0628\u0650\u064A\u0651\u064D \u0639\u064E\u062F\u064F\u0648\u0651\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E\u06D7 \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0647\u064E\u0627\u062F\u0650\u064A\u0657\u0627 \u0648\u064E\u0646\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 32, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0646\u064F\u0632\u0651\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064F \u062C\u064F\u0645\u06E1\u0644\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u0646\u064F\u062B\u064E\u0628\u0651\u0650\u062A\u064E \u0628\u0650\u0647\u0650\u06E6 \u0641\u064F\u0624\u064E\u0627\u062F\u064E\u0643\u064E\u06D6 \u0648\u064E\u0631\u064E\u062A\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u062A\u064E\u0631\u06E1\u062A\u0650\u064A\u0644\u0657\u0627" }, { id: 33, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E\u0643\u064E \u0628\u0650\u0645\u064E\u062B\u064E\u0644\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u062C\u0650\u0626\u06E1\u0646\u064E\u0670\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u062A\u064E\u0641\u06E1\u0633\u0650\u064A\u0631\u064B\u0627" }, { id: 34, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064F\u062C\u064F\u0648\u0647\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0634\u064E\u0631\u0651\u065E \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u0657\u0627 \u0648\u064E\u0623\u064E\u0636\u064E\u0644\u0651\u064F \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 35, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062E\u064E\u0627\u0647\u064F \u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0648\u064E\u0632\u0650\u064A\u0631\u0657\u0627" }, { id: 36, text: "\u0641\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0671\u0630\u06E1\u0647\u064E\u0628\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u062F\u064E\u0645\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u062A\u064E\u062F\u06E1\u0645\u0650\u064A\u0631\u0657\u0627" }, { id: 37, text: "\u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064E \u0646\u064F\u0648\u062D\u0656 \u0644\u0651\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064E \u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0621\u064E\u0627\u064A\u064E\u0629\u0657\u06D6 \u0648\u064E\u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 38, text: "\u0648\u064E\u0639\u064E\u0627\u062F\u0657\u0627 \u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064E\u0627\u0652 \u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u0651\u0650 \u0648\u064E\u0642\u064F\u0631\u064F\u0648\u0646\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627" }, { id: 39, text: "\u0648\u064E\u0643\u064F\u0644\u0651\u0657\u0627 \u0636\u064E\u0631\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u064E\u06D6 \u0648\u064E\u0643\u064F\u0644\u0651\u0657\u0627 \u062A\u064E\u0628\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u062A\u064E\u062A\u06E1\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 40, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u062A\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064F\u0645\u06E1\u0637\u0650\u0631\u064E\u062A\u06E1 \u0645\u064E\u0637\u064E\u0631\u064E \u0671\u0644\u0633\u0651\u064E\u0648\u06E1\u0621\u0650\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E\u0647\u064E\u0627\u06DA \u0628\u064E\u0644\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0646\u064F\u0634\u064F\u0648\u0631\u0657\u0627" }, { id: 41, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0643\u064E \u0625\u0650\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0646\u064E\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0632\u064F\u0648\u064B\u0627 \u0623\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u064E\u0639\u064E\u062B\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0633\u064F\u0648\u0644\u064B\u0627" }, { id: 42, text: "\u0625\u0650\u0646 \u0643\u064E\u0627\u062F\u064E \u0644\u064E\u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0646\u064E\u0627 \u0639\u064E\u0646\u06E1 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u0650\u0646\u064E\u0627 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u0635\u064E\u0628\u064E\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06DA \u0648\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u062D\u0650\u064A\u0646\u064E \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0645\u064E\u0646\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064F \u0633\u064E\u0628\u0650\u064A\u0644\u064B\u0627" }, { id: 43, text: "\u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E \u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0625\u0650\u0644\u064E\u0670\u0647\u064E\u0647\u064F\u06E5 \u0647\u064E\u0648\u064E\u0649\u0670\u0647\u064F \u0623\u064E\u0641\u064E\u0623\u064E\u0646\u062A\u064E \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0643\u0650\u064A\u0644\u064B\u0627" }, { id: 44, text: "\u0623\u064E\u0645\u06E1 \u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F \u0623\u064E\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u0623\u064E\u0648\u06E1 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E\u06DA \u0625\u0650\u0646\u06E1 \u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064F \u0633\u064E\u0628\u0650\u064A\u0644\u064B\u0627" }, { id: 45, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0643\u064E\u064A\u06E1\u0641\u064E \u0645\u064E\u062F\u0651\u064E \u0671\u0644\u0638\u0651\u0650\u0644\u0651\u064E \u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0644\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u06E5 \u0633\u064E\u0627\u0643\u0650\u0646\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062F\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 46, text: "\u062B\u064F\u0645\u0651\u064E \u0642\u064E\u0628\u064E\u0636\u06E1\u0646\u064E\u0670\u0647\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0642\u064E\u0628\u06E1\u0636\u0657\u0627 \u064A\u064E\u0633\u0650\u064A\u0631\u0657\u0627" }, { id: 47, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0644\u0650\u0628\u064E\u0627\u0633\u0657\u0627 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0648\u06E1\u0645\u064E \u0633\u064F\u0628\u064E\u0627\u062A\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0646\u064F\u0634\u064F\u0648\u0631\u0657\u0627" }, { id: 48, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u064E \u0671\u0644\u0631\u0651\u0650\u064A\u064E\u0670\u062D\u064E \u0628\u064F\u0634\u06E1\u0631\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1 \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0637\u064E\u0647\u064F\u0648\u0631\u0657\u0627" }, { id: 49, text: "\u0644\u0651\u0650\u0646\u064F\u062D\u06E1\u0640\u06E7\u0650\u064A\u064E \u0628\u0650\u0647\u0650\u06E6 \u0628\u064E\u0644\u06E1\u062F\u064E\u0629\u0657 \u0645\u0651\u064E\u064A\u06E1\u062A\u0657\u0627 \u0648\u064E\u0646\u064F\u0633\u06E1\u0642\u0650\u064A\u064E\u0647\u064F\u06E5 \u0645\u0650\u0645\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0657\u0627 \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u0633\u0650\u064A\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627" }, { id: 50, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0635\u064E\u0631\u0651\u064E\u0641\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u064E\u0628\u064E\u0649\u0670\u0653 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064F\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 51, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u0650\u0626\u06E1\u0646\u064E\u0627 \u0644\u064E\u0628\u064E\u0639\u064E\u062B\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0643\u064F\u0644\u0651\u0650 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0656 \u0646\u0651\u064E\u0630\u0650\u064A\u0631\u0657\u0627" }, { id: 52, text: "\u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u0639\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u062C\u064E\u0670\u0647\u0650\u062F\u06E1\u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062C\u0650\u0647\u064E\u0627\u062F\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 53, text: "\u06DE\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0645\u064E\u0631\u064E\u062C\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E\u064A\u06E1\u0646\u0650 \u0647\u064E\u0670\u0630\u064E\u0627 \u0639\u064E\u0630\u06E1\u0628\u065E \u0641\u064F\u0631\u064E\u0627\u062A\u065E \u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u0650\u0644\u06E1\u062D\u064C \u0623\u064F\u062C\u064E\u0627\u062C\u065E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0628\u064E\u0631\u06E1\u0632\u064E\u062E\u0657\u0627 \u0648\u064E\u062D\u0650\u062C\u06E1\u0631\u0657\u0627 \u0645\u0651\u064E\u062D\u06E1\u062C\u064F\u0648\u0631\u0657\u0627" }, { id: 54, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u0650 \u0628\u064E\u0634\u064E\u0631\u0657\u0627 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u06E5 \u0646\u064E\u0633\u064E\u0628\u0657\u0627 \u0648\u064E\u0635\u0650\u0647\u06E1\u0631\u0657\u0627\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0642\u064E\u062F\u0650\u064A\u0631\u0657\u0627" }, { id: 55, text: "\u0648\u064E\u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0627\u0641\u0650\u0631\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0638\u064E\u0647\u0650\u064A\u0631\u0657\u0627" }, { id: 56, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u0657\u0627 \u0648\u064E\u0646\u064E\u0630\u0650\u064A\u0631\u0657\u0627" }, { id: 57, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 58, text: "\u0648\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0627 \u064A\u064E\u0645\u064F\u0648\u062A\u064F \u0648\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0647\u0650\u06E6 \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u062E\u064E\u0628\u0650\u064A\u0631\u064B\u0627" }, { id: 59, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0641\u0650\u064A \u0633\u0650\u062A\u0651\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650\u06D6 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0641\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u062E\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 60, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652\u06E4 \u0644\u0650\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0623\u064E\u0646\u064E\u0633\u06E1\u062C\u064F\u062F\u064F \u0644\u0650\u0645\u064E\u0627 \u062A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0646\u064E\u0627 \u0648\u064E\u0632\u064E\u0627\u062F\u064E\u0647\u064F\u0645\u06E1 \u0646\u064F\u0641\u064F\u0648\u0631\u0657\u0627\u06E9" }, { id: 61, text: "\u062A\u064E\u0628\u064E\u0627\u0631\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0628\u064F\u0631\u064F\u0648\u062C\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0633\u0650\u0631\u064E\u0670\u062C\u0657\u0627 \u0648\u064E\u0642\u064E\u0645\u064E\u0631\u0657\u0627 \u0645\u0651\u064F\u0646\u0650\u064A\u0631\u0657\u0627" }, { id: 62, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u062E\u0650\u0644\u06E1\u0641\u064E\u0629\u0657 \u0644\u0651\u0650\u0645\u064E\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0623\u064E\u0646 \u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064E \u0623\u064E\u0648\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0634\u064F\u0643\u064F\u0648\u0631\u0657\u0627" }, { id: 63, text: "\u0648\u064E\u0639\u0650\u0628\u064E\u0627\u062F\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0645\u06E1\u0634\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0647\u064E\u0648\u06E1\u0646\u0657\u0627 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062E\u064E\u0627\u0637\u064E\u0628\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u064F\u0648\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0644\u064E\u0670\u0645\u0657\u0627" }, { id: 64, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0628\u0650\u064A\u062A\u064F\u0648\u0646\u064E \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627 \u0648\u064E\u0642\u0650\u064A\u064E\u0670\u0645\u0657\u0627" }, { id: 65, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0671\u0635\u06E1\u0631\u0650\u0641\u06E1 \u0639\u064E\u0646\u0651\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E\u0647\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u063A\u064E\u0631\u064E\u0627\u0645\u064B\u0627" }, { id: 66, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0633\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u0657\u0627 \u0648\u064E\u0645\u064F\u0642\u064E\u0627\u0645\u0657\u0627" }, { id: 67, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652 \u0644\u064E\u0645\u06E1 \u064A\u064F\u0633\u06E1\u0631\u0650\u0641\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0642\u06E1\u062A\u064F\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0642\u064E\u0648\u064E\u0627\u0645\u0657\u0627" }, { id: 68, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0641\u06E1\u0633\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062D\u064E\u0631\u0651\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0632\u06E1\u0646\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u06E1 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0644\u06E1\u0642\u064E \u0623\u064E\u062B\u064E\u0627\u0645\u0657\u0627" }, { id: 69, text: "\u064A\u064F\u0636\u064E\u0670\u0639\u064E\u0641\u06E1 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0648\u064E\u064A\u064E\u062E\u06E1\u0644\u064F\u062F\u06E1 \u0641\u0650\u064A\u0647\u0650\u06E6 \u0645\u064F\u0647\u064E\u0627\u0646\u064B\u0627" }, { id: 70, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u062A\u064E\u0627\u0628\u064E \u0648\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0639\u064E\u0645\u064E\u0644\u0657\u0627 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u0633\u064E\u0646\u064E\u0670\u062A\u0656\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 71, text: "\u0648\u064E\u0645\u064E\u0646 \u062A\u064E\u0627\u0628\u064E \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u062A\u064F\u0648\u0628\u064F \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u062A\u064E\u0627\u0628\u0657\u0627" }, { id: 72, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0646\u064E \u0671\u0644\u0632\u0651\u064F\u0648\u0631\u064E \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u063A\u06E1\u0648\u0650 \u0645\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0643\u0650\u0631\u064E\u0627\u0645\u0657\u0627" }, { id: 73, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627 \u0630\u064F\u0643\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0645\u06E1 \u064A\u064E\u062E\u0650\u0631\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0635\u064F\u0645\u0651\u0657\u0627 \u0648\u064E\u0639\u064F\u0645\u06E1\u064A\u064E\u0627\u0646\u0657\u0627" }, { id: 74, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0647\u064E\u0628\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0646\u064E\u0627 \u0648\u064E\u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0640\u0670\u062A\u0650\u0646\u064E\u0627 \u0642\u064F\u0631\u0651\u064E\u0629\u064E \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0656 \u0648\u064E\u0671\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0625\u0650\u0645\u064E\u0627\u0645\u064B\u0627" }, { id: 75, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0671\u0644\u06E1\u063A\u064F\u0631\u06E1\u0641\u064E\u0629\u064E \u0628\u0650\u0645\u064E\u0627 \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064F\u0644\u064E\u0642\u0651\u064E\u0648\u06E1\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u062A\u064E\u062D\u0650\u064A\u0651\u064E\u0629\u0657 \u0648\u064E\u0633\u064E\u0644\u064E\u0670\u0645\u064B\u0627" }, { id: 76, text: "\u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u062D\u064E\u0633\u064F\u0646\u064E\u062A\u06E1 \u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u0657\u0627 \u0648\u064E\u0645\u064F\u0642\u064E\u0627\u0645\u0657\u0627" }, { id: 77, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0628\u064E\u0624\u064F\u0627\u0652 \u0628\u0650\u0643\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u062F\u064F\u0639\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u0650\u0632\u064E\u0627\u0645\u064E\u06E2\u0627" }] }, { id: 26, name: "\u0627\u0644\u0634\u0639\u0631\u0627\u0621", transliteration: "Ash-Shu'ara", type: "meccan", total_verses: 227, verses: [{ id: 1, text: "\u0637\u0633\u0653\u0645\u0653" }, { id: 2, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u0650" }, { id: 3, text: "\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064E \u0628\u064E\u0670\u062E\u0650\u0639\u065E \u0646\u0651\u064E\u0641\u06E1\u0633\u064E\u0643\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 4, text: "\u0625\u0650\u0646 \u0646\u0651\u064E\u0634\u064E\u0623\u06E1 \u0646\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0641\u064E\u0638\u064E\u0644\u0651\u064E\u062A\u06E1 \u0623\u064E\u0639\u06E1\u0646\u064E\u0670\u0642\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064E\u0627 \u062E\u064E\u0670\u0636\u0650\u0639\u0650\u064A\u0646\u064E" }, { id: 5, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0630\u0650\u0643\u06E1\u0631\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0645\u064F\u062D\u06E1\u062F\u064E\u062B\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F \u0645\u064F\u0639\u06E1\u0631\u0650\u0636\u0650\u064A\u0646\u064E" }, { id: 6, text: "\u0641\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0641\u064E\u0633\u064E\u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0643\u064E\u0645\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0632\u064E\u0648\u06E1\u062C\u0656 \u0643\u064E\u0631\u0650\u064A\u0645\u064D" }, { id: 8, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 10, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0650 \u0671\u0626\u06E1\u062A\u0650 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u0642\u064E\u0648\u06E1\u0645\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E\u06DA \u0623\u064E\u0644\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0623\u064E\u0646 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u0650" }, { id: 13, text: "\u0648\u064E\u064A\u064E\u0636\u0650\u064A\u0642\u064F \u0635\u064E\u062F\u06E1\u0631\u0650\u064A \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0646\u0637\u064E\u0644\u0650\u0642\u064F \u0644\u0650\u0633\u064E\u0627\u0646\u0650\u064A \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u0650\u0644\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0630\u064E\u0646\u06E2\u0628\u065E \u0641\u064E\u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0623\u064E\u0646 \u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u0650" }, { id: 15, text: "\u0642\u064E\u0627\u0644\u064E \u0643\u064E\u0644\u0651\u064E\u0627\u06D6 \u0641\u064E\u0671\u0630\u06E1\u0647\u064E\u0628\u064E\u0627 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064E\u0639\u064E\u0643\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0641\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0627 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0641\u064E\u0642\u064F\u0648\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0631\u064E\u0633\u064F\u0648\u0644\u064F \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u0623\u064E\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0633\u0650\u0644\u06E1 \u0645\u064E\u0639\u064E\u0646\u064E\u0627 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E" }, { id: 18, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0644\u064E\u0645\u06E1 \u0646\u064F\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u0650\u064A\u0646\u064E\u0627 \u0648\u064E\u0644\u0650\u064A\u062F\u0657\u0627 \u0648\u064E\u0644\u064E\u0628\u0650\u062B\u06E1\u062A\u064E \u0641\u0650\u064A\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0639\u064F\u0645\u064F\u0631\u0650\u0643\u064E \u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u0641\u064E\u0639\u064E\u0644\u06E1\u062A\u064E \u0641\u064E\u0639\u06E1\u0644\u064E\u062A\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0641\u064E\u0639\u064E\u0644\u06E1\u062A\u064E \u0648\u064E\u0623\u064E\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 20, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0639\u064E\u0644\u06E1\u062A\u064F\u0647\u064E\u0627\u0653 \u0625\u0650\u0630\u0657\u0627 \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0645\u0650\u0646\u064E \u0671\u0644\u0636\u0651\u064E\u0627\u0653\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0641\u064E\u0641\u064E\u0631\u064E\u0631\u06E1\u062A\u064F \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0644\u064E\u0645\u0651\u064E\u0627 \u062E\u0650\u0641\u06E1\u062A\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0648\u064E\u0647\u064E\u0628\u064E \u0644\u0650\u064A \u0631\u064E\u0628\u0651\u0650\u064A \u062D\u064F\u0643\u06E1\u0645\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u065E \u062A\u064E\u0645\u064F\u0646\u0651\u064F\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0623\u064E\u0646\u06E1 \u0639\u064E\u0628\u0651\u064E\u062F\u062A\u0651\u064E \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E" }, { id: 23, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0648\u064E\u0645\u064E\u0627 \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 24, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0648\u0642\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 25, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0645\u064E\u0646\u06E1 \u062D\u064E\u0648\u06E1\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0628\u0651\u064F \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 27, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0644\u064E\u0645\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u065E" }, { id: 28, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0631\u0650\u0642\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0631\u0650\u0628\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0626\u0650\u0646\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064E \u0625\u0650\u0644\u064E\u0670\u0647\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u0650\u064A \u0644\u064E\u0623\u064E\u062C\u06E1\u0639\u064E\u0644\u064E\u0646\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u064F\u0648\u0646\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0648\u064E\u0644\u064E\u0648\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064F\u0643\u064E \u0628\u0650\u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 31, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670 \u0639\u064E\u0635\u064E\u0627\u0647\u064F \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u0650\u064A\u064E \u062B\u064F\u0639\u06E1\u0628\u064E\u0627\u0646\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 33, text: "\u0648\u064E\u0646\u064E\u0632\u064E\u0639\u064E \u064A\u064E\u062F\u064E\u0647\u064F\u06E5 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0636\u064E\u0627\u0653\u0621\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0640\u0670\u0638\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 34, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0644\u06E1\u0645\u064E\u0644\u064E\u0625\u0650 \u062D\u064E\u0648\u06E1\u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0633\u064E\u0670\u062D\u0650\u0631\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 35, text: "\u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0636\u0650\u0643\u064F\u0645 \u0628\u0650\u0633\u0650\u062D\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0641\u064E\u0645\u064E\u0627\u0630\u064E\u0627 \u062A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0631\u06E1\u062C\u0650\u0647\u06E1 \u0648\u064E\u0623\u064E\u062E\u064E\u0627\u0647\u064F \u0648\u064E\u0671\u0628\u06E1\u0639\u064E\u062B\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062F\u064E\u0627\u0653\u0626\u0650\u0646\u0650 \u062D\u064E\u0670\u0634\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 37, text: "\u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0643\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0633\u064E\u062D\u0651\u064E\u0627\u0631\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 38, text: "\u0641\u064E\u062C\u064F\u0645\u0650\u0639\u064E \u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0631\u064E\u0629\u064F \u0644\u0650\u0645\u0650\u064A\u0642\u064E\u0670\u062A\u0650 \u064A\u064E\u0648\u06E1\u0645\u0656 \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u0656" }, { id: 39, text: "\u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0647\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u062C\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0646\u064E\u0627 \u0646\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0631\u064E\u0629\u064E \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0644\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0631\u064E\u0629\u064F \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0623\u064E\u0626\u0650\u0646\u0651\u064E \u0644\u064E\u0646\u064E\u0627 \u0644\u064E\u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0644\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 42, text: "\u0642\u064E\u0627\u0644\u064E \u0646\u064E\u0639\u064E\u0645\u06E1 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0631\u0651\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 43, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0644\u06E1\u0642\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0644\u06E1\u0642\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0648\u06E1\u0627\u0652 \u062D\u0650\u0628\u064E\u0627\u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0639\u0650\u0635\u0650\u064A\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u0650\u0639\u0650\u0632\u0651\u064E\u0629\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0639\u064E\u0635\u064E\u0627\u0647\u064F \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u0650\u064A\u064E \u062A\u064E\u0644\u06E1\u0642\u064E\u0641\u064F \u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u0641\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u0641\u064E\u0623\u064F\u0644\u06E1\u0642\u0650\u064A\u064E \u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0631\u064E\u0629\u064F \u0633\u064E\u0670\u062C\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0631\u064E\u0628\u0651\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0642\u064E\u0627\u0644\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0642\u064E\u0628\u06E1\u0644\u064E \u0623\u064E\u0646\u06E1 \u0621\u064E\u0627\u0630\u064E\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0643\u064E\u0628\u0650\u064A\u0631\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0639\u064E\u0644\u0651\u064E\u0645\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u0650\u062D\u06E1\u0631\u064E \u0641\u064E\u0644\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E\u06DA \u0644\u064E\u0623\u064F\u0642\u064E\u0637\u0651\u0650\u0639\u064E\u0646\u0651\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u0650\u0644\u064E\u0670\u0641\u0656 \u0648\u064E\u0644\u064E\u0623\u064F\u0635\u064E\u0644\u0651\u0650\u0628\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u0636\u064E\u064A\u06E1\u0631\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0645\u064F\u0646\u0642\u064E\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u0637\u06E1\u0645\u064E\u0639\u064F \u0623\u064E\u0646 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0644\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u062E\u064E\u0637\u064E\u0670\u064A\u064E\u0670\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0643\u064F\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 52, text: "\u06DE\u0648\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0631\u0650 \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A\u0653 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u064F\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062F\u064E\u0627\u0653\u0626\u0650\u0646\u0650 \u062D\u064E\u0670\u0634\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0644\u064E\u0634\u0650\u0631\u06E1\u0630\u0650\u0645\u064E\u0629\u065E \u0642\u064E\u0644\u0650\u064A\u0644\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0644\u064E\u063A\u064E\u0627\u0653\u0626\u0650\u0638\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u062C\u064E\u0645\u0650\u064A\u0639\u064C \u062D\u064E\u0670\u0630\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u0639\u064F\u064A\u064F\u0648\u0646\u0656" }, { id: 58, text: "\u0648\u064E\u0643\u064F\u0646\u064F\u0648\u0632\u0656 \u0648\u064E\u0645\u064E\u0642\u064E\u0627\u0645\u0656 \u0643\u064E\u0631\u0650\u064A\u0645\u0656" }, { id: 59, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0648\u064E\u0623\u064E\u0648\u06E1\u0631\u064E\u062B\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E" }, { id: 60, text: "\u0641\u064E\u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u064F\u0648\u0647\u064F\u0645 \u0645\u0651\u064F\u0634\u06E1\u0631\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 61, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0640\u0670\u0653\u0621\u064E\u0627 \u0671\u0644\u06E1\u062C\u064E\u0645\u06E1\u0639\u064E\u0627\u0646\u0650 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064F\u062F\u06E1\u0631\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0642\u064E\u0627\u0644\u064E \u0643\u064E\u0644\u0651\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E \u0645\u064E\u0639\u0650\u064A\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0633\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0646\u0650" }, { id: 63, text: "\u0641\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0650 \u0671\u0636\u06E1\u0631\u0650\u0628 \u0628\u0651\u0650\u0639\u064E\u0635\u064E\u0627\u0643\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E\u06D6 \u0641\u064E\u0671\u0646\u0641\u064E\u0644\u064E\u0642\u064E \u0641\u064E\u0643\u064E\u0627\u0646\u064E \u0643\u064F\u0644\u0651\u064F \u0641\u0650\u0631\u06E1\u0642\u0656 \u0643\u064E\u0671\u0644\u0637\u0651\u064E\u0648\u06E1\u062F\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 64, text: "\u0648\u064E\u0623\u064E\u0632\u06E1\u0644\u064E\u0641\u06E1\u0646\u064E\u0627 \u062B\u064E\u0645\u0651\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 65, text: "\u0648\u064E\u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0646 \u0645\u0651\u064E\u0639\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 66, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 67, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 68, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 69, text: "\u0648\u064E\u0671\u062A\u06E1\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0646\u064E\u0628\u064E\u0623\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E" }, { id: 70, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0623\u064E\u0628\u0650\u064A\u0647\u0650 \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0646\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0623\u064E\u0635\u06E1\u0646\u064E\u0627\u0645\u0657\u0627 \u0641\u064E\u0646\u064E\u0638\u064E\u0644\u0651\u064F \u0644\u064E\u0647\u064E\u0627 \u0639\u064E\u0670\u0643\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 72, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0644\u06E1 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0623\u064E\u0648\u06E1 \u064A\u064E\u0646\u0641\u064E\u0639\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0648\u0646\u064E" }, { id: 74, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u06E1 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 75, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u062F\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 77, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0644\u0651\u0650\u064A\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u0628\u0651\u064E \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 78, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0646\u0650\u064A \u0641\u064E\u0647\u064F\u0648\u064E \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0646\u0650" }, { id: 79, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0647\u064F\u0648\u064E \u064A\u064F\u0637\u06E1\u0639\u0650\u0645\u064F\u0646\u0650\u064A \u0648\u064E\u064A\u064E\u0633\u06E1\u0642\u0650\u064A\u0646\u0650" }, { id: 80, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0631\u0650\u0636\u06E1\u062A\u064F \u0641\u064E\u0647\u064F\u0648\u064E \u064A\u064E\u0634\u06E1\u0641\u0650\u064A\u0646\u0650" }, { id: 81, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0645\u0650\u064A\u062A\u064F\u0646\u0650\u064A \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u062D\u06E1\u064A\u0650\u064A\u0646\u0650" }, { id: 82, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0637\u06E1\u0645\u064E\u0639\u064F \u0623\u064E\u0646 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0644\u0650\u064A \u062E\u064E\u0637\u0650\u064A\u0653\u0640\u0654\u064E\u062A\u0650\u064A \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 83, text: "\u0631\u064E\u0628\u0651\u0650 \u0647\u064E\u0628\u06E1 \u0644\u0650\u064A \u062D\u064F\u0643\u06E1\u0645\u0657\u0627 \u0648\u064E\u0623\u064E\u0644\u06E1\u062D\u0650\u0642\u06E1\u0646\u0650\u064A \u0628\u0650\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 84, text: "\u0648\u064E\u0671\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u0650\u064A \u0644\u0650\u0633\u064E\u0627\u0646\u064E \u0635\u0650\u062F\u06E1\u0642\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 85, text: "\u0648\u064E\u0671\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u0650\u064A \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u062B\u064E\u0629\u0650 \u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0671\u0644\u0646\u0651\u064E\u0639\u0650\u064A\u0645\u0650" }, { id: 86, text: "\u0648\u064E\u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u0650\u0623\u064E\u0628\u0650\u064A\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0636\u0651\u064E\u0627\u0653\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 87, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062E\u06E1\u0632\u0650\u0646\u0650\u064A \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0646\u064E" }, { id: 88, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F \u0645\u064E\u0627\u0644\u065E \u0648\u064E\u0644\u064E\u0627 \u0628\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 89, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0623\u064E\u062A\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0642\u064E\u0644\u06E1\u0628\u0656 \u0633\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 90, text: "\u0648\u064E\u0623\u064F\u0632\u06E1\u0644\u0650\u0641\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064F \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 91, text: "\u0648\u064E\u0628\u064F\u0631\u0651\u0650\u0632\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u064F \u0644\u0650\u0644\u06E1\u063A\u064E\u0627\u0648\u0650\u064A\u0646\u064E" }, { id: 92, text: "\u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u064A\u06E1\u0646\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 93, text: "\u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064E\u0644\u06E1 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u064A\u064E\u0646\u062A\u064E\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 94, text: "\u0641\u064E\u0643\u064F\u0628\u06E1\u0643\u0650\u0628\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u06E1\u063A\u064E\u0627\u0648\u064F\u06E5\u0646\u064E" }, { id: 95, text: "\u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u064F \u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064E \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 96, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u064A\u064E\u062E\u06E1\u062A\u064E\u0635\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u062A\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E\u0627 \u0644\u064E\u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 98, text: "\u0625\u0650\u0630\u06E1 \u0646\u064F\u0633\u064E\u0648\u0651\u0650\u064A\u0643\u064F\u0645 \u0628\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 99, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0636\u064E\u0644\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 100, text: "\u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0646\u064E\u0627 \u0645\u0650\u0646 \u0634\u064E\u0670\u0641\u0650\u0639\u0650\u064A\u0646\u064E" }, { id: 101, text: "\u0648\u064E\u0644\u064E\u0627 \u0635\u064E\u062F\u0650\u064A\u0642\u064D \u062D\u064E\u0645\u0650\u064A\u0645\u0656" }, { id: 102, text: "\u0641\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0646\u064E\u0627 \u0643\u064E\u0631\u0651\u064E\u0629\u0657 \u0641\u064E\u0646\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 103, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 104, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 105, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064F \u0646\u064F\u0648\u062D\u064D \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 106, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062E\u064F\u0648\u0647\u064F\u0645\u06E1 \u0646\u064F\u0648\u062D\u064C \u0623\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 107, text: "\u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064C \u0623\u064E\u0645\u0650\u064A\u0646\u065E" }, { id: 108, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 109, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064D\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 110, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 111, text: "\u06DE\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0644\u064E\u0643\u064E \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0630\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 112, text: "\u0642\u064E\u0627\u0644\u064E \u0648\u064E\u0645\u064E\u0627 \u0639\u0650\u0644\u06E1\u0645\u0650\u064A \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 113, text: "\u0625\u0650\u0646\u06E1 \u062D\u0650\u0633\u064E\u0627\u0628\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u064A\u06D6 \u0644\u064E\u0648\u06E1 \u062A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 114, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0628\u0650\u0637\u064E\u0627\u0631\u0650\u062F\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 115, text: "\u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 116, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0626\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0646\u062A\u064E\u0647\u0650 \u064A\u064E\u0670\u0646\u064F\u0648\u062D\u064F \u0644\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u062C\u064F\u0648\u0645\u0650\u064A\u0646\u064E" }, { id: 117, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u064E \u0642\u064E\u0648\u06E1\u0645\u0650\u064A \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0646\u0650" }, { id: 118, text: "\u0641\u064E\u0671\u0641\u06E1\u062A\u064E\u062D\u06E1 \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u062A\u06E1\u062D\u0657\u0627 \u0648\u064E\u0646\u064E\u062C\u0651\u0650\u0646\u0650\u064A \u0648\u064E\u0645\u064E\u0646 \u0645\u0651\u064E\u0639\u0650\u064A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 119, text: "\u0641\u064E\u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0645\u064E\u0646 \u0645\u0651\u064E\u0639\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u062D\u064F\u0648\u0646\u0650" }, { id: 120, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u062F\u064F \u0671\u0644\u06E1\u0628\u064E\u0627\u0642\u0650\u064A\u0646\u064E" }, { id: 121, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 122, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 123, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u0639\u064E\u0627\u062F\u064C \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 124, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062E\u064F\u0648\u0647\u064F\u0645\u06E1 \u0647\u064F\u0648\u062F\u064C \u0623\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 125, text: "\u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064C \u0623\u064E\u0645\u0650\u064A\u0646\u065E" }, { id: 126, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 127, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064D\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 128, text: "\u0623\u064E\u062A\u064E\u0628\u06E1\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0631\u0650\u064A\u0639\u064D \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u062A\u064E\u0639\u06E1\u0628\u064E\u062B\u064F\u0648\u0646\u064E" }, { id: 129, text: "\u0648\u064E\u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0646\u064E \u0645\u064E\u0635\u064E\u0627\u0646\u0650\u0639\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u062E\u06E1\u0644\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 130, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0637\u064E\u0634\u06E1\u062A\u064F\u0645 \u0628\u064E\u0637\u064E\u0634\u06E1\u062A\u064F\u0645\u06E1 \u062C\u064E\u0628\u0651\u064E\u0627\u0631\u0650\u064A\u0646\u064E" }, { id: 131, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 132, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0645\u064E\u062F\u0651\u064E\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 133, text: "\u0623\u064E\u0645\u064E\u062F\u0651\u064E\u0643\u064F\u0645 \u0628\u0650\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0656 \u0648\u064E\u0628\u064E\u0646\u0650\u064A\u0646\u064E" }, { id: 134, text: "\u0648\u064E\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u0639\u064F\u064A\u064F\u0648\u0646\u064D" }, { id: 135, text: "\u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 136, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u064E\u0639\u064E\u0638\u06E1\u062A\u064E \u0623\u064E\u0645\u06E1 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0648\u064E\u0670\u0639\u0650\u0638\u0650\u064A\u0646\u064E" }, { id: 137, text: "\u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u062E\u064F\u0644\u064F\u0642\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 138, text: "\u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u0645\u064F\u0639\u064E\u0630\u0651\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 139, text: "\u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F \u0641\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 140, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 141, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u062B\u064E\u0645\u064F\u0648\u062F\u064F \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 142, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062E\u064F\u0648\u0647\u064F\u0645\u06E1 \u0635\u064E\u0670\u0644\u0650\u062D\u064C \u0623\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 143, text: "\u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064C \u0623\u064E\u0645\u0650\u064A\u0646\u065E" }, { id: 144, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 145, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064D\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 146, text: "\u0623\u064E\u062A\u064F\u062A\u06E1\u0631\u064E\u0643\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0645\u064E\u0627 \u0647\u064E\u0670\u0647\u064F\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 147, text: "\u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u0639\u064F\u064A\u064F\u0648\u0646\u0656" }, { id: 148, text: "\u0648\u064E\u0632\u064F\u0631\u064F\u0648\u0639\u0656 \u0648\u064E\u0646\u064E\u062E\u06E1\u0644\u0656 \u0637\u064E\u0644\u06E1\u0639\u064F\u0647\u064E\u0627 \u0647\u064E\u0636\u0650\u064A\u0645\u065E" }, { id: 149, text: "\u0648\u064E\u062A\u064E\u0646\u06E1\u062D\u0650\u062A\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u0650 \u0628\u064F\u064A\u064F\u0648\u062A\u0657\u0627 \u0641\u064E\u0670\u0631\u0650\u0647\u0650\u064A\u0646\u064E" }, { id: 150, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 151, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u064A\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0631\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 152, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0635\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 153, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u064E\u062D\u0651\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 154, text: "\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0646\u064E\u0627 \u0641\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u064D \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 155, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0646\u064E\u0627\u0642\u064E\u0629\u065E \u0644\u0651\u064E\u0647\u064E\u0627 \u0634\u0650\u0631\u06E1\u0628\u065E \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0634\u0650\u0631\u06E1\u0628\u064F \u064A\u064E\u0648\u06E1\u0645\u0656 \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u0656" }, { id: 156, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u064E\u0633\u0651\u064F\u0648\u0647\u064E\u0627 \u0628\u0650\u0633\u064F\u0648\u0653\u0621\u0656 \u0641\u064E\u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064F \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 157, text: "\u0641\u064E\u0639\u064E\u0642\u064E\u0631\u064F\u0648\u0647\u064E\u0627 \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u0646\u064E\u0670\u062F\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 158, text: "\u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 159, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 160, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064F \u0644\u064F\u0648\u0637\u064D \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 161, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062E\u064F\u0648\u0647\u064F\u0645\u06E1 \u0644\u064F\u0648\u0637\u064C \u0623\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 162, text: "\u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064C \u0623\u064E\u0645\u0650\u064A\u0646\u065E" }, { id: 163, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 164, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064D\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 165, text: "\u0623\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0630\u0651\u064F\u0643\u06E1\u0631\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 166, text: "\u0648\u064E\u062A\u064E\u0630\u064E\u0631\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0643\u064F\u0645\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064C \u0639\u064E\u0627\u062F\u064F\u0648\u0646\u064E" }, { id: 167, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0626\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0646\u062A\u064E\u0647\u0650 \u064A\u064E\u0670\u0644\u064F\u0648\u0637\u064F \u0644\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0631\u064E\u062C\u0650\u064A\u0646\u064E" }, { id: 168, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u0650\u0639\u064E\u0645\u064E\u0644\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0627\u0644\u0650\u064A\u0646\u064E" }, { id: 169, text: "\u0631\u064E\u0628\u0651\u0650 \u0646\u064E\u062C\u0651\u0650\u0646\u0650\u064A \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u0650\u064A \u0645\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 170, text: "\u0641\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 171, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u062C\u064F\u0648\u0632\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u063A\u064E\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 172, text: "\u062B\u064F\u0645\u0651\u064E \u062F\u064E\u0645\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 173, text: "\u0648\u064E\u0623\u064E\u0645\u06E1\u0637\u064E\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064E\u0637\u064E\u0631\u0657\u0627\u06D6 \u0641\u064E\u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0637\u064E\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u0630\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 174, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 175, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 176, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0644\u06E1\u0640\u0654\u064E\u064A\u06E1\u0643\u064E\u0629\u0650 \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 177, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u064C \u0623\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 178, text: "\u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064C \u0623\u064E\u0645\u0650\u064A\u0646\u065E" }, { id: 179, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 180, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064D\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 181, text: "\u06DE\u0623\u064E\u0648\u06E1\u0641\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 182, text: "\u0648\u064E\u0632\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u064E\u0627\u0633\u0650 \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0650" }, { id: 183, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u062E\u064E\u0633\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0623\u064E\u0634\u06E1\u064A\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062B\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 184, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0628\u0650\u0644\u0651\u064E\u0629\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 185, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u064E\u062D\u0651\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 186, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0646 \u0646\u0651\u064E\u0638\u064F\u0646\u0651\u064F\u0643\u064E \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 187, text: "\u0641\u064E\u0623\u064E\u0633\u06E1\u0642\u0650\u0637\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0643\u0650\u0633\u064E\u0641\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 188, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 189, text: "\u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064F \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064F\u0644\u0651\u064E\u0629\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u064D" }, { id: 190, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 191, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 192, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u064F \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 193, text: "\u0646\u064E\u0632\u064E\u0644\u064E \u0628\u0650\u0647\u0650 \u0671\u0644\u0631\u0651\u064F\u0648\u062D\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u0650\u064A\u0646\u064F" }, { id: 194, text: "\u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0644\u06E1\u0628\u0650\u0643\u064E \u0644\u0650\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u0630\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 195, text: "\u0628\u0650\u0644\u0650\u0633\u064E\u0627\u0646\u064D \u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 196, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0641\u0650\u064A \u0632\u064F\u0628\u064F\u0631\u0650 \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 197, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u064B \u0623\u064E\u0646 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E\u0647\u064F\u06E5 \u0639\u064F\u0644\u064E\u0645\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E" }, { id: 198, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0650 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u062C\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 199, text: "\u0641\u064E\u0642\u064E\u0631\u064E\u0623\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 200, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0633\u064E\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064F \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 201, text: "\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0631\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u0623\u064E\u0644\u0650\u064A\u0645\u064E" }, { id: 202, text: "\u0641\u064E\u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645 \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 203, text: "\u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0644\u06E1 \u0646\u064E\u062D\u06E1\u0646\u064F \u0645\u064F\u0646\u0638\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 204, text: "\u0623\u064E\u0641\u064E\u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u0650\u0646\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 205, text: "\u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E \u0625\u0650\u0646 \u0645\u0651\u064E\u062A\u0651\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 206, text: "\u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 207, text: "\u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 208, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u064E\u0647\u064E\u0627 \u0645\u064F\u0646\u0630\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 209, text: "\u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0638\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 210, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064F" }, { id: 211, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0646\u06E2\u0628\u064E\u063A\u0650\u064A \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E" }, { id: 212, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u0650 \u0644\u064E\u0645\u064E\u0639\u06E1\u0632\u064F\u0648\u0644\u064F\u0648\u0646\u064E" }, { id: 213, text: "\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u064E \u0641\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0639\u064E\u0630\u0651\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 214, text: "\u0648\u064E\u0623\u064E\u0646\u0630\u0650\u0631\u06E1 \u0639\u064E\u0634\u0650\u064A\u0631\u064E\u062A\u064E\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 215, text: "\u0648\u064E\u0671\u062E\u06E1\u0641\u0650\u0636\u06E1 \u062C\u064E\u0646\u064E\u0627\u062D\u064E\u0643\u064E \u0644\u0650\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 216, text: "\u0641\u064E\u0625\u0650\u0646\u06E1 \u0639\u064E\u0635\u064E\u0648\u06E1\u0643\u064E \u0641\u064E\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0628\u064E\u0631\u0650\u064A\u0653\u0621\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 217, text: "\u0648\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 218, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0631\u064E\u0649\u0670\u0643\u064E \u062D\u0650\u064A\u0646\u064E \u062A\u064E\u0642\u064F\u0648\u0645\u064F" }, { id: 219, text: "\u0648\u064E\u062A\u064E\u0642\u064E\u0644\u0651\u064F\u0628\u064E\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0640\u0670\u062C\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 220, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 221, text: "\u0647\u064E\u0644\u06E1 \u0623\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646 \u062A\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064F" }, { id: 222, text: "\u062A\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0623\u064E\u0641\u0651\u064E\u0627\u0643\u064D \u0623\u064E\u062B\u0650\u064A\u0645\u0656" }, { id: 223, text: "\u064A\u064F\u0644\u06E1\u0642\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u064E \u0648\u064E\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 224, text: "\u0648\u064E\u0671\u0644\u0634\u0651\u064F\u0639\u064E\u0631\u064E\u0627\u0653\u0621\u064F \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0627\u0648\u064F\u06E5\u0646\u064E" }, { id: 225, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0643\u064F\u0644\u0651\u0650 \u0648\u064E\u0627\u062F\u0656 \u064A\u064E\u0647\u0650\u064A\u0645\u064F\u0648\u0646\u064E" }, { id: 226, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 227, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0648\u064E\u0630\u064E\u0643\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0671\u0646\u062A\u064E\u0635\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u0638\u064F\u0644\u0650\u0645\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0633\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u0651\u064E \u0645\u064F\u0646\u0642\u064E\u0644\u064E\u0628\u0656 \u064A\u064E\u0646\u0642\u064E\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }] }, { id: 27, name: "\u0627\u0644\u0646\u0645\u0644", transliteration: "An-Naml", type: "meccan", total_verses: 93, verses: [{ id: 1, text: "\u0637\u0633\u0653\u06DA \u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0648\u064E\u0643\u0650\u062A\u064E\u0627\u0628\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 2, text: "\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 3, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0642\u0650\u064A\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u064A\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0632\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0645\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u062E\u06E1\u0633\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u062A\u064F\u0644\u064E\u0642\u0651\u064E\u0649 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0645\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u06E1 \u062D\u064E\u0643\u0650\u064A\u0645\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u064D" }, { id: 7, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0621\u064E\u0627\u0646\u064E\u0633\u06E1\u062A\u064F \u0646\u064E\u0627\u0631\u0657\u0627 \u0633\u064E\u0640\u0654\u064E\u0627\u062A\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u0628\u0650\u062E\u064E\u0628\u064E\u0631\u064D \u0623\u064E\u0648\u06E1 \u0621\u064E\u0627\u062A\u0650\u064A\u0643\u064F\u0645 \u0628\u0650\u0634\u0650\u0647\u064E\u0627\u0628\u0656 \u0642\u064E\u0628\u064E\u0633\u0656 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0635\u06E1\u0637\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064E\u0627 \u0646\u064F\u0648\u062F\u0650\u064A\u064E \u0623\u064E\u0646\u06E2 \u0628\u064F\u0648\u0631\u0650\u0643\u064E \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0648\u064E\u0645\u064E\u0646\u06E1 \u062D\u064E\u0648\u06E1\u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 10, text: "\u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u0650 \u0639\u064E\u0635\u064E\u0627\u0643\u064E\u06DA \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0621\u064E\u0627\u0647\u064E\u0627 \u062A\u064E\u0647\u06E1\u062A\u064E\u0632\u0651\u064F \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064E\u0627 \u062C\u064E\u0627\u0653\u0646\u0651\u065E \u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0645\u064F\u062F\u06E1\u0628\u0650\u0631\u0657\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0639\u064E\u0642\u0651\u0650\u0628\u06E1\u06DA \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0641\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0627 \u064A\u064E\u062E\u064E\u0627\u0641\u064F \u0644\u064E\u062F\u064E\u064A\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0638\u064E\u0644\u064E\u0645\u064E \u062B\u064F\u0645\u0651\u064E \u0628\u064E\u062F\u0651\u064E\u0644\u064E \u062D\u064F\u0633\u06E1\u0646\u064E\u06E2\u0627 \u0628\u064E\u0639\u06E1\u062F\u064E \u0633\u064F\u0648\u0653\u0621\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 12, text: "\u0648\u064E\u0623\u064E\u062F\u06E1\u062E\u0650\u0644\u06E1 \u064A\u064E\u062F\u064E\u0643\u064E \u0641\u0650\u064A \u062C\u064E\u064A\u06E1\u0628\u0650\u0643\u064E \u062A\u064E\u062E\u06E1\u0631\u064F\u062C\u06E1 \u0628\u064E\u064A\u06E1\u0636\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646\u06E1 \u063A\u064E\u064A\u06E1\u0631\u0650 \u0633\u064F\u0648\u0653\u0621\u0656\u06D6 \u0641\u0650\u064A \u062A\u0650\u0633\u06E1\u0639\u0650 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064D \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 13, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0645\u064F\u0628\u06E1\u0635\u0650\u0631\u064E\u0629\u0657 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 14, text: "\u0648\u064E\u062C\u064E\u062D\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u064A\u06E1\u0642\u064E\u0646\u064E\u062A\u06E1\u0647\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0647\u064F\u0645\u06E1 \u0638\u064F\u0644\u06E1\u0645\u0657\u0627 \u0648\u064E\u0639\u064F\u0644\u064F\u0648\u0651\u0657\u0627\u06DA \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 15, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0648\u064E\u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0639\u0650\u0644\u06E1\u0645\u0657\u0627\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u064E\u0636\u0651\u064E\u0644\u064E\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064E\u062B\u0650\u064A\u0631\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 16, text: "\u0648\u064E\u0648\u064E\u0631\u0650\u062B\u064E \u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0639\u064F\u0644\u0651\u0650\u0645\u06E1\u0646\u064E\u0627 \u0645\u064E\u0646\u0637\u0650\u0642\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u0650 \u0648\u064E\u0623\u064F\u0648\u062A\u0650\u064A\u0646\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D\u06D6 \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 17, text: "\u0648\u064E\u062D\u064F\u0634\u0650\u0631\u064E \u0644\u0650\u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u062C\u064F\u0646\u064F\u0648\u062F\u064F\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650 \u0648\u064E\u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u0650 \u0641\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u0648\u0632\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0627\u062F\u0650 \u0671\u0644\u0646\u0651\u064E\u0645\u06E1\u0644\u0650 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0646\u064E\u0645\u06E1\u0644\u064E\u0629\u065E \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0645\u06E1\u0644\u064F \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0637\u0650\u0645\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u064F\u0647\u064F\u06E5 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0641\u064E\u062A\u064E\u0628\u064E\u0633\u0651\u064E\u0645\u064E \u0636\u064E\u0627\u062D\u0650\u0643\u0657\u0627 \u0645\u0651\u0650\u0646 \u0642\u064E\u0648\u06E1\u0644\u0650\u0647\u064E\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0623\u064E\u0648\u06E1\u0632\u0650\u0639\u06E1\u0646\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0634\u06E1\u0643\u064F\u0631\u064E \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u0651\u064E \u0648\u064E\u0623\u064E\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u062A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u062F\u06E1\u062E\u0650\u0644\u06E1\u0646\u0650\u064A \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0643\u064E \u0641\u0650\u064A \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0643\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u062A\u064E\u0641\u064E\u0642\u0651\u064E\u062F\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u064E \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0627\u0644\u0650\u064A\u064E \u0644\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0647\u064F\u062F\u06E1\u0647\u064F\u062F\u064E \u0623\u064E\u0645\u06E1 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0627\u0653\u0626\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0644\u064E\u0623\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0644\u064E\u0623\u064E\u0627\u0652\u0630\u06E1\u0628\u064E\u062D\u064E\u0646\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0648\u06E1 \u0644\u064E\u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u0651\u0650\u064A \u0628\u0650\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 22, text: "\u0641\u064E\u0645\u064E\u0643\u064E\u062B\u064E \u063A\u064E\u064A\u06E1\u0631\u064E \u0628\u064E\u0639\u0650\u064A\u062F\u0656 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u062D\u064E\u0637\u062A\u064F \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064F\u062D\u0650\u0637\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u062C\u0650\u0626\u06E1\u062A\u064F\u0643\u064E \u0645\u0650\u0646 \u0633\u064E\u0628\u064E\u0625\u0650\u06ED \u0628\u0650\u0646\u064E\u0628\u064E\u0625\u0656 \u064A\u064E\u0642\u0650\u064A\u0646\u064D" }, { id: 23, text: "\u0625\u0650\u0646\u0651\u0650\u064A \u0648\u064E\u062C\u064E\u062F\u062A\u0651\u064F \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u0629\u0657 \u062A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064F\u0648\u062A\u0650\u064A\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0644\u064E\u0647\u064E\u0627 \u0639\u064E\u0631\u06E1\u0634\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 24, text: "\u0648\u064E\u062C\u064E\u062F\u062A\u0651\u064F\u0647\u064E\u0627 \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064E\u0627 \u064A\u064E\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u0650 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0632\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0635\u064E\u062F\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0623\u064E\u0644\u0651\u064E\u0627\u06E4 \u064A\u064E\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652\u06E4 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u06E1\u0621\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064F\u062E\u06E1\u0641\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0639\u06E1\u0644\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650\u06E9" }, { id: 27, text: "\u06DE\u0642\u064E\u0627\u0644\u064E \u0633\u064E\u0646\u064E\u0646\u0638\u064F\u0631\u064F \u0623\u064E\u0635\u064E\u062F\u064E\u0642\u06E1\u062A\u064E \u0623\u064E\u0645\u06E1 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u0671\u0630\u06E1\u0647\u064E\u0628 \u0628\u0651\u0650\u0643\u0650\u062A\u064E\u0670\u0628\u0650\u064A \u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u0650\u0647\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0648\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0645\u064E\u0627\u0630\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0624\u064F\u0627\u0652 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064F\u0644\u06E1\u0642\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u064C" }, { id: 30, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0633\u06E1\u0645\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 31, text: "\u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0648\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0624\u064F\u0627\u0652 \u0623\u064E\u0641\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0641\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1\u0631\u0650\u064A \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F \u0642\u064E\u0627\u0637\u0650\u0639\u064E\u0629\u064B \u0623\u064E\u0645\u06E1\u0631\u064B\u0627 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u0648\u0646\u0650" }, { id: 33, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0642\u064F\u0648\u0651\u064E\u0629\u0656 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0623\u06E1\u0633\u0656 \u0634\u064E\u062F\u0650\u064A\u062F\u0656 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u0650 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u0650\u064A \u0645\u064E\u0627\u0630\u064E\u0627 \u062A\u064E\u0623\u06E1\u0645\u064F\u0631\u0650\u064A\u0646\u064E" }, { id: 34, text: "\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0644\u064F\u0648\u0643\u064E \u0625\u0650\u0630\u064E\u0627 \u062F\u064E\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064B \u0623\u064E\u0641\u06E1\u0633\u064E\u062F\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0639\u0650\u0632\u0651\u064E\u0629\u064E \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u0630\u0650\u0644\u0651\u064E\u0629\u0657\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064F\u0631\u06E1\u0633\u0650\u0644\u064E\u0629\u064C \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0647\u064E\u062F\u0650\u064A\u0651\u064E\u0629\u0656 \u0641\u064E\u0646\u064E\u0627\u0638\u0650\u0631\u064E\u0629\u064F\u06E2 \u0628\u0650\u0645\u064E \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u062A\u064F\u0645\u0650\u062F\u0651\u064F\u0648\u0646\u064E\u0646\u0650 \u0628\u0650\u0645\u064E\u0627\u0644\u0656 \u0641\u064E\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0646\u0650\u06E6\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0643\u064F\u0645\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u064E\u062F\u0650\u064A\u0651\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u062A\u064E\u0641\u06E1\u0631\u064E\u062D\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0671\u0631\u06E1\u062C\u0650\u0639\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0641\u064E\u0644\u064E\u0646\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0628\u0650\u062C\u064F\u0646\u064F\u0648\u062F\u0656 \u0644\u0651\u064E\u0627 \u0642\u0650\u0628\u064E\u0644\u064E \u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0646\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627\u0653 \u0623\u064E\u0630\u0650\u0644\u0651\u064E\u0629\u0657 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0635\u064E\u0670\u063A\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0624\u064F\u0627\u0652 \u0623\u064E\u064A\u0651\u064F\u0643\u064F\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u0650\u064A \u0628\u0650\u0639\u064E\u0631\u06E1\u0634\u0650\u0647\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 39, text: "\u0642\u064E\u0627\u0644\u064E \u0639\u0650\u0641\u06E1\u0631\u0650\u064A\u062A\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0621\u064E\u0627\u062A\u0650\u064A\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0642\u064E\u0628\u06E1\u0644\u064E \u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0645\u064E \u0645\u0650\u0646 \u0645\u0651\u064E\u0642\u064E\u0627\u0645\u0650\u0643\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0644\u064E\u0642\u064E\u0648\u0650\u064A\u0651\u064C \u0623\u064E\u0645\u0650\u064A\u0646\u065E" }, { id: 40, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0639\u0650\u0644\u06E1\u0645\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0621\u064E\u0627\u062A\u0650\u064A\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0642\u064E\u0628\u06E1\u0644\u064E \u0623\u064E\u0646 \u064A\u064E\u0631\u06E1\u062A\u064E\u062F\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0637\u064E\u0631\u06E1\u0641\u064F\u0643\u064E\u06DA \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0621\u064E\u0627\u0647\u064F \u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u0631\u0651\u064B\u0627 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u0650\u064A\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0646\u0650\u064A\u0653 \u0621\u064E\u0623\u064E\u0634\u06E1\u0643\u064F\u0631\u064F \u0623\u064E\u0645\u06E1 \u0623\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0634\u064E\u0643\u064E\u0631\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u063A\u064E\u0646\u0650\u064A\u0651\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u065E" }, { id: 41, text: "\u0642\u064E\u0627\u0644\u064E \u0646\u064E\u0643\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064E\u0627 \u0639\u064E\u0631\u06E1\u0634\u064E\u0647\u064E\u0627 \u0646\u064E\u0646\u0638\u064F\u0631\u06E1 \u0623\u064E\u062A\u064E\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0642\u0650\u064A\u0644\u064E \u0623\u064E\u0647\u064E\u0670\u0643\u064E\u0630\u064E\u0627 \u0639\u064E\u0631\u06E1\u0634\u064F\u0643\u0650\u06D6 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E\u06DA \u0648\u064E\u0623\u064F\u0648\u062A\u0650\u064A\u0646\u064E\u0627 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u064E\u0627 \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0635\u064E\u062F\u0651\u064E\u0647\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E\u062A \u062A\u0651\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0656 \u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 44, text: "\u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064E\u0627 \u0671\u062F\u06E1\u062E\u064F\u0644\u0650\u064A \u0671\u0644\u0635\u0651\u064E\u0631\u06E1\u062D\u064E\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0623\u064E\u062A\u06E1\u0647\u064F \u062D\u064E\u0633\u0650\u0628\u064E\u062A\u06E1\u0647\u064F \u0644\u064F\u062C\u0651\u064E\u0629\u0657 \u0648\u064E\u0643\u064E\u0634\u064E\u0641\u064E\u062A\u06E1 \u0639\u064E\u0646 \u0633\u064E\u0627\u0642\u064E\u064A\u06E1\u0647\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0635\u064E\u0631\u06E1\u062D\u065E \u0645\u0651\u064F\u0645\u064E\u0631\u0651\u064E\u062F\u065E \u0645\u0651\u0650\u0646 \u0642\u064E\u0648\u064E\u0627\u0631\u0650\u064A\u0631\u064E\u06D7 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0638\u064E\u0644\u064E\u0645\u06E1\u062A\u064F \u0646\u064E\u0641\u06E1\u0633\u0650\u064A \u0648\u064E\u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u06E1\u062A\u064F \u0645\u064E\u0639\u064E \u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u062B\u064E\u0645\u064F\u0648\u062F\u064E \u0623\u064E\u062E\u064E\u0627\u0647\u064F\u0645\u06E1 \u0635\u064E\u0670\u0644\u0650\u062D\u064B\u0627 \u0623\u064E\u0646\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u0641\u064E\u0631\u0650\u064A\u0642\u064E\u0627\u0646\u0650 \u064A\u064E\u062E\u06E1\u062A\u064E\u0635\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u0650\u0645\u064E \u062A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0650 \u0642\u064E\u0628\u06E1\u0644\u064E \u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0650\u06D6 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0631\u06E1\u062D\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0637\u0651\u064E\u064A\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0628\u0650\u0643\u064E \u0648\u064E\u0628\u0650\u0645\u064E\u0646 \u0645\u0651\u064E\u0639\u064E\u0643\u064E\u06DA \u0642\u064E\u0627\u0644\u064E \u0637\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u064F\u0643\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0628\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u062A\u064F\u0641\u06E1\u062A\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u062A\u0650\u0633\u06E1\u0639\u064E\u0629\u064F \u0631\u064E\u0647\u06E1\u0637\u0656 \u064A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0635\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062A\u064E\u0642\u064E\u0627\u0633\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0646\u064F\u0628\u064E\u064A\u0651\u0650\u062A\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0646\u064E\u0642\u064F\u0648\u0644\u064E\u0646\u0651\u064E \u0644\u0650\u0648\u064E\u0644\u0650\u064A\u0651\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u0634\u064E\u0647\u0650\u062F\u06E1\u0646\u064E\u0627 \u0645\u064E\u0647\u06E1\u0644\u0650\u0643\u064E \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0635\u064E\u0670\u062F\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0648\u064E\u0645\u064E\u0643\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0643\u06E1\u0631\u0657\u0627 \u0648\u064E\u0645\u064E\u0643\u064E\u0631\u06E1\u0646\u064E\u0627 \u0645\u064E\u0643\u06E1\u0631\u0657\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0645\u064E\u0643\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0627 \u062F\u064E\u0645\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 52, text: "\u0641\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u0628\u064F\u064A\u064F\u0648\u062A\u064F\u0647\u064F\u0645\u06E1 \u062E\u064E\u0627\u0648\u0650\u064A\u064E\u0629\u064E\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0648\u064E\u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u0648\u064E\u0644\u064F\u0648\u0637\u064B\u0627 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u064E \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0623\u064E\u0626\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u062C\u064E\u0627\u0644\u064E \u0634\u064E\u0647\u06E1\u0648\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u062A\u064E\u062C\u06E1\u0647\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u06DE\u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u062C\u064E\u0648\u064E\u0627\u0628\u064E \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0644\u064E \u0644\u064F\u0648\u0637\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u062A\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064F\u0646\u064E\u0627\u0633\u065E \u064A\u064E\u062A\u064E\u0637\u064E\u0647\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0641\u064E\u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E\u0647\u064F\u06E5 \u0642\u064E\u062F\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0623\u064E\u0645\u06E1\u0637\u064E\u0631\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064E\u0637\u064E\u0631\u0657\u0627\u06D6 \u0641\u064E\u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0637\u064E\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u0630\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 59, text: "\u0642\u064F\u0644\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0635\u06E1\u0637\u064E\u0641\u064E\u0649\u0670\u0653\u06D7 \u0621\u064E\u0627\u0653\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u064A\u06E1\u0631\u064C \u0623\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0623\u064E\u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u062D\u064E\u062F\u064E\u0627\u0653\u0626\u0650\u0642\u064E \u0630\u064E\u0627\u062A\u064E \u0628\u064E\u0647\u06E1\u062C\u064E\u0629\u0656 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064F\u0646\u06E2\u0628\u0650\u062A\u064F\u0648\u0627\u0652 \u0634\u064E\u062C\u064E\u0631\u064E\u0647\u064E\u0627\u0653\u06D7 \u0623\u064E\u0621\u0650\u0644\u064E\u0670\u0647\u065E \u0645\u0651\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u064A\u064E\u0639\u06E1\u062F\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 61, text: "\u0623\u064E\u0645\u0651\u064E\u0646 \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0642\u064E\u0631\u064E\u0627\u0631\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u062E\u0650\u0644\u064E\u0670\u0644\u064E\u0647\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0647\u064E\u0627 \u0631\u064E\u0648\u064E\u0670\u0633\u0650\u064A\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E\u064A\u06E1\u0646\u0650 \u062D\u064E\u0627\u062C\u0650\u0632\u064B\u0627\u06D7 \u0623\u064E\u0621\u0650\u0644\u064E\u0670\u0647\u065E \u0645\u0651\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0623\u064E\u0645\u0651\u064E\u0646 \u064A\u064F\u062C\u0650\u064A\u0628\u064F \u0671\u0644\u06E1\u0645\u064F\u0636\u06E1\u0637\u064E\u0631\u0651\u064E \u0625\u0650\u0630\u064E\u0627 \u062F\u064E\u0639\u064E\u0627\u0647\u064F \u0648\u064E\u064A\u064E\u0643\u06E1\u0634\u0650\u0641\u064F \u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u064E \u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u062E\u064F\u0644\u064E\u0641\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0623\u064E\u0621\u0650\u0644\u064E\u0670\u0647\u065E \u0645\u0651\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0623\u064E\u0645\u0651\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0638\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064F \u0671\u0644\u0631\u0651\u0650\u064A\u064E\u0670\u062D\u064E \u0628\u064F\u0634\u06E1\u0631\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1 \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6\u0653\u06D7 \u0623\u064E\u0621\u0650\u0644\u064E\u0670\u0647\u065E \u0645\u0651\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0623\u064E\u0645\u0651\u064E\u0646 \u064A\u064E\u0628\u06E1\u062F\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u064E \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0639\u0650\u064A\u062F\u064F\u0647\u064F\u06E5 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0623\u064E\u0621\u0650\u0644\u064E\u0670\u0647\u065E \u0645\u0651\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0642\u064F\u0644\u06E1 \u0647\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0628\u064F\u0631\u06E1\u0647\u064E\u0670\u0646\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 65, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E \u0623\u064E\u064A\u0651\u064E\u0627\u0646\u064E \u064A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0628\u064E\u0644\u0650 \u0671\u062F\u0651\u064E\u0640\u0670\u0631\u064E\u0643\u064E \u0639\u0650\u0644\u06E1\u0645\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627\u06D6 \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u0639\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u062A\u064F\u0631\u064E\u0670\u0628\u0657\u0627 \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627\u0653 \u0623\u064E\u0626\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064F\u062E\u06E1\u0631\u064E\u062C\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0648\u064F\u0639\u0650\u062F\u06E1\u0646\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u064E\u0670\u0637\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 69, text: "\u0642\u064F\u0644\u06E1 \u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 70, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0646 \u0641\u0650\u064A \u0636\u064E\u064A\u06E1\u0642\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u062A\u064E\u0649\u0670 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0648\u064E\u0639\u06E1\u062F\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 72, text: "\u0642\u064F\u0644\u06E1 \u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0631\u064E\u062F\u0650\u0641\u064E \u0644\u064E\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0630\u064F\u0648 \u0641\u064E\u0636\u06E1\u0644\u064D \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 74, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064F\u0643\u0650\u0646\u0651\u064F \u0635\u064F\u062F\u064F\u0648\u0631\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0639\u06E1\u0644\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 75, text: "\u0648\u064E\u0645\u064E\u0627 \u0645\u0650\u0646\u06E1 \u063A\u064E\u0627\u0653\u0626\u0650\u0628\u064E\u0629\u0656 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 76, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u064A\u064E\u0642\u064F\u0635\u0651\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 77, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 78, text: "\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u064A\u064E\u0642\u06E1\u0636\u0650\u064A \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u062D\u064F\u0643\u06E1\u0645\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 79, text: "\u0641\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u0650" }, { id: 80, text: "\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0627 \u062A\u064F\u0633\u06E1\u0645\u0650\u0639\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0633\u06E1\u0645\u0650\u0639\u064F \u0671\u0644\u0635\u0651\u064F\u0645\u0651\u064E \u0671\u0644\u062F\u0651\u064F\u0639\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u0630\u064E\u0627 \u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0645\u064F\u062F\u06E1\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 81, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0628\u0650\u0647\u064E\u0670\u062F\u0650\u064A \u0671\u0644\u06E1\u0639\u064F\u0645\u06E1\u064A\u0650 \u0639\u064E\u0646 \u0636\u064E\u0644\u064E\u0670\u0644\u064E\u062A\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0625\u0650\u0646 \u062A\u064F\u0633\u06E1\u0645\u0650\u0639\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 82, text: "\u06DE\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0648\u064E\u0642\u064E\u0639\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0644\u064E\u0627 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u062D\u06E1\u0634\u064F\u0631\u064F \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u0641\u064E\u0648\u06E1\u062C\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0646 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u0648\u0632\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 84, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064F\u0648 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u06E1\u062A\u064F\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064F\u062D\u0650\u064A\u0637\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627 \u0639\u0650\u0644\u06E1\u0645\u064B\u0627 \u0623\u064E\u0645\u0651\u064E\u0627\u0630\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 85, text: "\u0648\u064E\u0648\u064E\u0642\u064E\u0639\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0645\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0646\u0637\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 86, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0644\u0650\u064A\u064E\u0633\u06E1\u0643\u064F\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0645\u064F\u0628\u06E1\u0635\u0650\u0631\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 87, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0646\u0641\u064E\u062E\u064F \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u0648\u0631\u0650 \u0641\u064E\u0641\u064E\u0632\u0650\u0639\u064E \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u064C \u0623\u064E\u062A\u064E\u0648\u06E1\u0647\u064F \u062F\u064E\u0670\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 88, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064E \u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0647\u064E\u0627 \u062C\u064E\u0627\u0645\u0650\u062F\u064E\u0629\u0657 \u0648\u064E\u0647\u0650\u064A\u064E \u062A\u064E\u0645\u064F\u0631\u0651\u064F \u0645\u064E\u0631\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u062D\u064E\u0627\u0628\u0650\u06DA \u0635\u064F\u0646\u06E1\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u062A\u06E1\u0642\u064E\u0646\u064E \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 89, text: "\u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0650 \u0641\u064E\u0644\u064E\u0647\u064F\u06E5 \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0632\u064E\u0639\u0656 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 90, text: "\u0648\u064E\u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0650 \u0641\u064E\u0643\u064F\u0628\u0651\u064E\u062A\u06E1 \u0648\u064F\u062C\u064F\u0648\u0647\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0647\u064E\u0644\u06E1 \u062A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 91, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064E \u0631\u064E\u0628\u0651\u064E \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u0628\u064E\u0644\u06E1\u062F\u064E\u0629\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062D\u064E\u0631\u0651\u064E\u0645\u064E\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0647\u064F\u06E5 \u0643\u064F\u0644\u0651\u064F \u0634\u064E\u064A\u06E1\u0621\u0656\u06D6 \u0648\u064E\u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 92, text: "\u0648\u064E\u0623\u064E\u0646\u06E1 \u0623\u064E\u062A\u06E1\u0644\u064F\u0648\u064E\u0627\u0652 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E\u06D6 \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0649\u0670 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u0650\u064A \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0636\u064E\u0644\u0651\u064E \u0641\u064E\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u0630\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 93, text: "\u0648\u064E\u0642\u064F\u0644\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0633\u064E\u064A\u064F\u0631\u0650\u064A\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0641\u064E\u062A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E\u0647\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0628\u0650\u063A\u064E\u0670\u0641\u0650\u0644\u064D \u0639\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }] }, { id: 28, name: "\u0627\u0644\u0642\u0635\u0635", transliteration: "Al-Qasas", type: "meccan", total_verses: 88, verses: [{ id: 1, text: "\u0637\u0633\u0653\u0645\u0653" }, { id: 2, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u0650" }, { id: 3, text: "\u0646\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0646\u0651\u064E\u0628\u064E\u0625\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064E\u0627 \u0634\u0650\u064A\u064E\u0639\u0657\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0636\u06E1\u0639\u0650\u0641\u064F \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064F\u0630\u064E\u0628\u0651\u0650\u062D\u064F \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062D\u06E1\u064A\u0650\u06E6 \u0646\u0650\u0633\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 5, text: "\u0648\u064E\u0646\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u0646\u0651\u064E\u0645\u064F\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064F\u0636\u06E1\u0639\u0650\u0641\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0626\u0650\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0648\u064E\u0670\u0631\u0650\u062B\u0650\u064A\u0646\u064E" }, { id: 6, text: "\u0648\u064E\u0646\u064F\u0645\u064E\u0643\u0651\u0650\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0646\u064F\u0631\u0650\u064A\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0647\u064E\u0670\u0645\u064E\u0670\u0646\u064E \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u064E\u0647\u064F\u0645\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u062D\u06E1\u0630\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u0651\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0636\u0650\u0639\u0650\u064A\u0647\u0650\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062E\u0650\u0641\u06E1\u062A\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u0650\u064A\u0647\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u064A\u064E\u0645\u0651\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0627\u0641\u0650\u064A \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u0650\u064A\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0627 \u0631\u064E\u0627\u0653\u062F\u0651\u064F\u0648\u0647\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u0650 \u0648\u064E\u062C\u064E\u0627\u0639\u0650\u0644\u064F\u0648\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u0641\u064E\u0671\u0644\u06E1\u062A\u064E\u0642\u064E\u0637\u064E\u0647\u064F\u06E5\u0653 \u0621\u064E\u0627\u0644\u064F \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0644\u0650\u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u0657\u0627 \u0648\u064E\u062D\u064E\u0632\u064E\u0646\u064B\u0627\u06D7 \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0647\u064E\u0670\u0645\u064E\u0670\u0646\u064E \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u064E\u0647\u064F\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u062E\u064E\u0670\u0637\u0650\u0640\u0654\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064F \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0642\u064F\u0631\u0651\u064E\u062A\u064F \u0639\u064E\u064A\u06E1\u0646\u0656 \u0644\u0651\u0650\u064A \u0648\u064E\u0644\u064E\u0643\u064E\u06D6 \u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0647\u064F \u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0646\u0641\u064E\u0639\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0646\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u062F\u0657\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064E \u0641\u064F\u0624\u064E\u0627\u062F\u064F \u0623\u064F\u0645\u0651\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0641\u064E\u0670\u0631\u0650\u063A\u064B\u0627\u06D6 \u0625\u0650\u0646 \u0643\u064E\u0627\u062F\u064E\u062A\u06E1 \u0644\u064E\u062A\u064F\u0628\u06E1\u062F\u0650\u064A \u0628\u0650\u0647\u0650\u06E6 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u0631\u0651\u064E\u0628\u064E\u0637\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0644\u06E1\u0628\u0650\u0647\u064E\u0627 \u0644\u0650\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0644\u0650\u0623\u064F\u062E\u06E1\u062A\u0650\u0647\u0650\u06E6 \u0642\u064F\u0635\u0651\u0650\u064A\u0647\u0650\u06D6 \u0641\u064E\u0628\u064E\u0635\u064F\u0631\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0639\u064E\u0646 \u062C\u064F\u0646\u064F\u0628\u0656 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u06DE\u0648\u064E\u062D\u064E\u0631\u0651\u064E\u0645\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0631\u064E\u0627\u0636\u0650\u0639\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0641\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0647\u064E\u0644\u06E1 \u0623\u064E\u062F\u064F\u0644\u0651\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0628\u064E\u064A\u06E1\u062A\u0656 \u064A\u064E\u0643\u06E1\u0641\u064F\u0644\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0646\u064E\u0670\u0635\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0641\u064E\u0631\u064E\u062F\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064F \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u0651\u0650\u0647\u0650\u06E6 \u0643\u064E\u064A\u06E1 \u062A\u064E\u0642\u064E\u0631\u0651\u064E \u0639\u064E\u064A\u06E1\u0646\u064F\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u064E \u0648\u064E\u0644\u0650\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0623\u064E\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u065E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E \u0623\u064E\u0634\u064F\u062F\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u062D\u064F\u0643\u06E1\u0645\u0657\u0627 \u0648\u064E\u0639\u0650\u0644\u06E1\u0645\u0657\u0627\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 15, text: "\u0648\u064E\u062F\u064E\u062E\u064E\u0644\u064E \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0650 \u063A\u064E\u0641\u06E1\u0644\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u064E\u0627 \u0641\u064E\u0648\u064E\u062C\u064E\u062F\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0631\u064E\u062C\u064F\u0644\u064E\u064A\u06E1\u0646\u0650 \u064A\u064E\u0642\u06E1\u062A\u064E\u062A\u0650\u0644\u064E\u0627\u0646\u0650 \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u0650\u0646 \u0634\u0650\u064A\u0639\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u064E\u0670\u062B\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0645\u0650\u0646 \u0634\u0650\u064A\u0639\u064E\u062A\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0645\u0650\u0646\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u0650\u0647\u0650\u06E6 \u0641\u064E\u0648\u064E\u0643\u064E\u0632\u064E\u0647\u064F\u06E5 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0641\u064E\u0642\u064E\u0636\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06D6 \u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0639\u064E\u0645\u064E\u0644\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0645\u0651\u064F\u0636\u0650\u0644\u0651\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 16, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0638\u064E\u0644\u064E\u0645\u06E1\u062A\u064F \u0646\u064E\u0641\u06E1\u0633\u0650\u064A \u0641\u064E\u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u0650\u064A \u0641\u064E\u063A\u064E\u0641\u064E\u0631\u064E \u0644\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 17, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0641\u064E\u0644\u064E\u0646\u06E1 \u0623\u064E\u0643\u064F\u0648\u0646\u064E \u0638\u064E\u0647\u0650\u064A\u0631\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u062E\u064E\u0627\u0653\u0626\u0650\u0641\u0657\u0627 \u064A\u064E\u062A\u064E\u0631\u064E\u0642\u0651\u064E\u0628\u064F \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0671\u0633\u06E1\u062A\u064E\u0646\u0635\u064E\u0631\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0633\u0650 \u064A\u064E\u0633\u06E1\u062A\u064E\u0635\u06E1\u0631\u0650\u062E\u064F\u0647\u064F\u06E5\u06DA \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u063A\u064E\u0648\u0650\u064A\u0651\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 19, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0623\u064E\u0646 \u064A\u064E\u0628\u06E1\u0637\u0650\u0634\u064E \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0647\u064F\u0648\u064E \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u062A\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064E\u0646\u0650\u064A \u0643\u064E\u0645\u064E\u0627 \u0642\u064E\u062A\u064E\u0644\u06E1\u062A\u064E \u0646\u064E\u0641\u06E1\u0633\u064E\u06E2\u0627 \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0633\u0650\u06D6 \u0625\u0650\u0646 \u062A\u064F\u0631\u0650\u064A\u062F\u064F \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u062C\u064E\u0628\u0651\u064E\u0627\u0631\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0635\u06E1\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u062C\u064F\u0644\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0642\u06E1\u0635\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u064A\u064E\u0633\u06E1\u0639\u064E\u0649\u0670 \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064E \u064A\u064E\u0623\u06E1\u062A\u064E\u0645\u0650\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0643\u064E \u0644\u0650\u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0643\u064E \u0641\u064E\u0671\u062E\u06E1\u0631\u064F\u062C\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0640\u0670\u0635\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0641\u064E\u062E\u064E\u0631\u064E\u062C\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062E\u064E\u0627\u0653\u0626\u0650\u0641\u0657\u0627 \u064A\u064E\u062A\u064E\u0631\u064E\u0642\u0651\u064E\u0628\u064F\u06D6 \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0646\u064E\u062C\u0651\u0650\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0648\u064E\u062C\u0651\u064E\u0647\u064E \u062A\u0650\u0644\u06E1\u0642\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u062F\u06E1\u064A\u064E\u0646\u064E \u0642\u064E\u0627\u0644\u064E \u0639\u064E\u0633\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u064E\u0646\u0650\u064A \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650" }, { id: 23, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0648\u064E\u0631\u064E\u062F\u064E \u0645\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u062F\u06E1\u064A\u064E\u0646\u064E \u0648\u064E\u062C\u064E\u062F\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u064A\u064E\u0633\u06E1\u0642\u064F\u0648\u0646\u064E \u0648\u064E\u0648\u064E\u062C\u064E\u062F\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u0645\u064F \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u062A\u064E\u0630\u064F\u0648\u062F\u064E\u0627\u0646\u0650\u06D6 \u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0627 \u062E\u064E\u0637\u06E1\u0628\u064F\u0643\u064F\u0645\u064E\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E\u062A\u064E\u0627 \u0644\u064E\u0627 \u0646\u064E\u0633\u06E1\u0642\u0650\u064A \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0635\u06E1\u062F\u0650\u0631\u064E \u0671\u0644\u0631\u0651\u0650\u0639\u064E\u0627\u0653\u0621\u064F\u06D6 \u0648\u064E\u0623\u064E\u0628\u064F\u0648\u0646\u064E\u0627 \u0634\u064E\u064A\u06E1\u062E\u065E \u0643\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 24, text: "\u0641\u064E\u0633\u064E\u0642\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645\u064E\u0627 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0638\u0651\u0650\u0644\u0651\u0650 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u062A\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0645\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u0641\u064E\u0642\u0650\u064A\u0631\u065E" }, { id: 25, text: "\u0641\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F \u0625\u0650\u062D\u06E1\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u064E\u0627 \u062A\u064E\u0645\u06E1\u0634\u0650\u064A \u0639\u064E\u0644\u064E\u0649 \u0671\u0633\u06E1\u062A\u0650\u062D\u06E1\u064A\u064E\u0627\u0653\u0621\u0656 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0628\u0650\u064A \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0643\u064E \u0644\u0650\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E\u0643\u064E \u0623\u064E\u062C\u06E1\u0631\u064E \u0645\u064E\u0627 \u0633\u064E\u0642\u064E\u064A\u06E1\u062A\u064E \u0644\u064E\u0646\u064E\u0627\u06DA \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u06E5 \u0648\u064E\u0642\u064E\u0635\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0642\u064E\u0635\u064E\u0635\u064E \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0641\u06E1\u06D6 \u0646\u064E\u062C\u064E\u0648\u06E1\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0625\u0650\u062D\u06E1\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u064E\u0627 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u062A\u0650 \u0671\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u062C\u0650\u0631\u06E1\u0647\u064F\u06D6 \u0625\u0650\u0646\u0651\u064E \u062E\u064E\u064A\u06E1\u0631\u064E \u0645\u064E\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u062C\u064E\u0631\u06E1\u062A\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u0650\u064A\u0646\u064F" }, { id: 27, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646\u06E1 \u0623\u064F\u0646\u0643\u0650\u062D\u064E\u0643\u064E \u0625\u0650\u062D\u06E1\u062F\u064E\u0649 \u0671\u0628\u06E1\u0646\u064E\u062A\u064E\u064A\u0651\u064E \u0647\u064E\u0670\u062A\u064E\u064A\u06E1\u0646\u0650 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u062C\u064F\u0631\u064E\u0646\u0650\u064A \u062B\u064E\u0645\u064E\u0670\u0646\u0650\u064A\u064E \u062D\u0650\u062C\u064E\u062C\u0656\u06D6 \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u062A\u06E1\u0645\u064E\u0645\u06E1\u062A\u064E \u0639\u064E\u0634\u06E1\u0631\u0657\u0627 \u0641\u064E\u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0643\u064E\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0634\u064F\u0642\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E\u06DA \u0633\u064E\u062A\u064E\u062C\u0650\u062F\u064F\u0646\u0650\u064A\u0653 \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u0642\u064E\u0627\u0644\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064E\u06D6 \u0623\u064E\u064A\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u062C\u064E\u0644\u064E\u064A\u06E1\u0646\u0650 \u0642\u064E\u0636\u064E\u064A\u06E1\u062A\u064F \u0641\u064E\u0644\u064E\u0627 \u0639\u064F\u062F\u06E1\u0648\u064E\u0670\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u0651\u064E\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0646\u064E\u0642\u064F\u0648\u0644\u064F \u0648\u064E\u0643\u0650\u064A\u0644\u065E" }, { id: 29, text: "\u06DE\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0642\u064E\u0636\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u062C\u064E\u0644\u064E \u0648\u064E\u0633\u064E\u0627\u0631\u064E \u0628\u0650\u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653 \u0621\u064E\u0627\u0646\u064E\u0633\u064E \u0645\u0650\u0646 \u062C\u064E\u0627\u0646\u0650\u0628\u0650 \u0671\u0644\u0637\u0651\u064F\u0648\u0631\u0650 \u0646\u064E\u0627\u0631\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650 \u0671\u0645\u06E1\u0643\u064F\u062B\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0621\u064E\u0627\u0646\u064E\u0633\u06E1\u062A\u064F \u0646\u064E\u0627\u0631\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u0650\u064A\u0653 \u0621\u064E\u0627\u062A\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u0628\u0650\u062E\u064E\u0628\u064E\u0631\u064D \u0623\u064E\u0648\u06E1 \u062C\u064E\u0630\u06E1\u0648\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0635\u06E1\u0637\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064E\u0627 \u0646\u064F\u0648\u062F\u0650\u064A\u064E \u0645\u0650\u0646 \u0634\u064E\u0670\u0637\u0650\u064A\u0655\u0650 \u0671\u0644\u06E1\u0648\u064E\u0627\u062F\u0650 \u0671\u0644\u06E1\u0623\u064E\u064A\u06E1\u0645\u064E\u0646\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064F\u0642\u06E1\u0639\u064E\u0629\u0650 \u0671\u0644\u06E1\u0645\u064F\u0628\u064E\u0670\u0631\u064E\u0643\u064E\u0629\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u064E\u0629\u0650 \u0623\u064E\u0646 \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 31, text: "\u0648\u064E\u0623\u064E\u0646\u06E1 \u0623\u064E\u0644\u06E1\u0642\u0650 \u0639\u064E\u0635\u064E\u0627\u0643\u064E\u06DA \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0621\u064E\u0627\u0647\u064E\u0627 \u062A\u064E\u0647\u06E1\u062A\u064E\u0632\u0651\u064F \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064E\u0627 \u062C\u064E\u0627\u0653\u0646\u0651\u065E \u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0645\u064F\u062F\u06E1\u0628\u0650\u0631\u0657\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0639\u064E\u0642\u0651\u0650\u0628\u06E1\u06DA \u064A\u064E\u0670\u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0642\u06E1\u0628\u0650\u0644\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0641\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0671\u0633\u06E1\u0644\u064F\u0643\u06E1 \u064A\u064E\u062F\u064E\u0643\u064E \u0641\u0650\u064A \u062C\u064E\u064A\u06E1\u0628\u0650\u0643\u064E \u062A\u064E\u062E\u06E1\u0631\u064F\u062C\u06E1 \u0628\u064E\u064A\u06E1\u0636\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646\u06E1 \u063A\u064E\u064A\u06E1\u0631\u0650 \u0633\u064F\u0648\u0653\u0621\u0656 \u0648\u064E\u0671\u0636\u06E1\u0645\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u062C\u064E\u0646\u064E\u0627\u062D\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u0647\u06E1\u0628\u0650\u06D6 \u0641\u064E\u0630\u064E\u0670\u0646\u0650\u0643\u064E \u0628\u064F\u0631\u06E1\u0647\u064E\u0670\u0646\u064E\u0627\u0646\u0650 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0645\u064E\u0644\u064E\u0625\u0650\u064A\u0652\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0642\u064E\u062A\u064E\u0644\u06E1\u062A\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0646\u064E\u0641\u06E1\u0633\u0657\u0627 \u0641\u064E\u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0623\u064E\u0646 \u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u0650" }, { id: 34, text: "\u0648\u064E\u0623\u064E\u062E\u0650\u064A \u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064F \u0647\u064F\u0648\u064E \u0623\u064E\u0641\u06E1\u0635\u064E\u062D\u064F \u0645\u0650\u0646\u0651\u0650\u064A \u0644\u0650\u0633\u064E\u0627\u0646\u0657\u0627 \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u0650\u0644\u06E1\u0647\u064F \u0645\u064E\u0639\u0650\u064A\u064E \u0631\u0650\u062F\u06E1\u0621\u0657\u0627 \u064A\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u064F\u0646\u0650\u064A\u0653\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0623\u064E\u0646 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u0650" }, { id: 35, text: "\u0642\u064E\u0627\u0644\u064E \u0633\u064E\u0646\u064E\u0634\u064F\u062F\u0651\u064F \u0639\u064E\u0636\u064F\u062F\u064E\u0643\u064E \u0628\u0650\u0623\u064E\u062E\u0650\u064A\u0643\u064E \u0648\u064E\u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0644\u064E\u0643\u064F\u0645\u064E\u0627 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0635\u0650\u0644\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064E\u0627 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653\u06DA \u0623\u064E\u0646\u062A\u064F\u0645\u064E\u0627 \u0648\u064E\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E\u0643\u064F\u0645\u064E\u0627 \u0671\u0644\u06E1\u063A\u064E\u0670\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0648\u0633\u064E\u0649\u0670 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0641\u06E1\u062A\u064E\u0631\u0657\u0649 \u0648\u064E\u0645\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 37, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u0645\u064E\u0646 \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0645\u064E\u0627 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064F \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u063A\u064E\u064A\u06E1\u0631\u0650\u064A \u0641\u064E\u0623\u064E\u0648\u06E1\u0642\u0650\u062F\u06E1 \u0644\u0650\u064A \u064A\u064E\u0670\u0647\u064E\u0670\u0645\u064E\u0670\u0646\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0637\u0651\u0650\u064A\u0646\u0650 \u0641\u064E\u0671\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u0650\u064A \u0635\u064E\u0631\u06E1\u062D\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u0650\u064A\u0653 \u0623\u064E\u0637\u0651\u064E\u0644\u0650\u0639\u064F \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0623\u064E\u0638\u064F\u0646\u0651\u064F\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 39, text: "\u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064E \u0647\u064F\u0648\u064E \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0638\u064E\u0646\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0644\u064E\u0627 \u064A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0641\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u064E\u0647\u064F\u06E5 \u0641\u064E\u0646\u064E\u0628\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u064A\u064E\u0645\u0651\u0650\u06D6 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0623\u064E\u0626\u0650\u0645\u0651\u064E\u0629\u0657 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0644\u064E\u0627 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0648\u064E\u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0644\u064E\u0639\u06E1\u0646\u064E\u0629\u0657\u06D6 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0642\u06E1\u0628\u064F\u0648\u062D\u0650\u064A\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670 \u0628\u064E\u0635\u064E\u0627\u0653\u0626\u0650\u0631\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u0628\u0650\u062C\u064E\u0627\u0646\u0650\u0628\u0650 \u0671\u0644\u06E1\u063A\u064E\u0631\u06E1\u0628\u0650\u064A\u0651\u0650 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0636\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064E \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0634\u064E\u0623\u06E1\u0646\u064E\u0627 \u0642\u064F\u0631\u064F\u0648\u0646\u0657\u0627 \u0641\u064E\u062A\u064E\u0637\u064E\u0627\u0648\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0639\u064F\u0645\u064F\u0631\u064F\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u062B\u064E\u0627\u0648\u0650\u064A\u0657\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0645\u064E\u062F\u06E1\u064A\u064E\u0646\u064E \u062A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064F\u0631\u06E1\u0633\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u0628\u0650\u062C\u064E\u0627\u0646\u0650\u0628\u0650 \u0671\u0644\u0637\u0651\u064F\u0648\u0631\u0650 \u0625\u0650\u0630\u06E1 \u0646\u064E\u0627\u062F\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u0650\u062A\u064F\u0646\u0630\u0650\u0631\u064E \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0630\u0650\u064A\u0631\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064F\u0635\u0650\u064A\u0628\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0635\u0650\u064A\u0628\u064E\u0629\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u062A\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0641\u064E\u0646\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0643\u064E \u0648\u064E\u0646\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0646\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0645\u0650\u062B\u06E1\u0644\u064E \u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653\u06DA \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u0650\u062D\u06E1\u0631\u064E\u0627\u0646\u0650 \u062A\u064E\u0638\u064E\u0670\u0647\u064E\u0631\u064E\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0628\u0650\u0643\u064F\u0644\u0651\u0656 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0642\u064F\u0644\u06E1 \u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0648\u064E \u0623\u064E\u0647\u06E1\u062F\u064E\u0649\u0670 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064E\u0627\u0653 \u0623\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u06E1\u0647\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064E \u0641\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0647\u064E\u0648\u064E\u0649\u0670\u0647\u064F \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0647\u064F\u062F\u0657\u0649 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 51, text: "\u06DE\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0648\u064E\u0635\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u064A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064F\u0624\u06E1\u062A\u064E\u0648\u06E1\u0646\u064E \u0623\u064E\u062C\u06E1\u0631\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0631\u0651\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0628\u0650\u0645\u064E\u0627 \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u062F\u06E1\u0631\u064E\u0621\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0650 \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u064E \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u063A\u06E1\u0648\u064E \u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0643\u064F\u0645\u06E1 \u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u0646\u064E\u0628\u06E1\u062A\u064E\u063A\u0650\u064A \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 56, text: "\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0627 \u062A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646\u06E1 \u0623\u064E\u062D\u06E1\u0628\u064E\u0628\u06E1\u062A\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 57, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u0646\u0651\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u0650 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0645\u064E\u0639\u064E\u0643\u064E \u0646\u064F\u062A\u064E\u062E\u064E\u0637\u0651\u064E\u0641\u06E1 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0636\u0650\u0646\u064E\u0627\u0653\u06DA \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u0646\u064F\u0645\u064E\u0643\u0651\u0650\u0646 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u0631\u064E\u0645\u064B\u0627 \u0621\u064E\u0627\u0645\u0650\u0646\u0657\u0627 \u064A\u064F\u062C\u06E1\u0628\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062B\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u064F \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0631\u0651\u0650\u0632\u06E1\u0642\u0657\u0627 \u0645\u0651\u0650\u0646 \u0644\u0651\u064E\u062F\u064F\u0646\u0651\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0643\u064E\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0650\u06ED \u0628\u064E\u0637\u0650\u0631\u064E\u062A\u06E1 \u0645\u064E\u0639\u0650\u064A\u0634\u064E\u062A\u064E\u0647\u064E\u0627\u06D6 \u0641\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u0645\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0645\u06E1 \u062A\u064F\u0633\u06E1\u0643\u064E\u0646 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627\u06D6 \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u06E1\u0648\u064E\u0670\u0631\u0650\u062B\u0650\u064A\u0646\u064E" }, { id: 59, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0645\u064F\u0647\u06E1\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064E \u0641\u0650\u064A\u0653 \u0623\u064F\u0645\u0651\u0650\u0647\u064E\u0627 \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064F\u0647\u06E1\u0644\u0650\u0643\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064F\u0647\u064E\u0627 \u0638\u064E\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0645\u064E\u062A\u064E\u0670\u0639\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0632\u0650\u064A\u0646\u064E\u062A\u064F\u0647\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E \u0648\u064E\u0623\u064E\u0628\u06E1\u0642\u064E\u0649\u0670\u0653\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 61, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u0648\u064E\u0639\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0639\u06E1\u062F\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627 \u0641\u064E\u0647\u064F\u0648\u064E \u0644\u064E\u0670\u0642\u0650\u064A\u0647\u0650 \u0643\u064E\u0645\u064E\u0646 \u0645\u0651\u064E\u062A\u0651\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u064E\u062A\u064E\u0670\u0639\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062B\u064F\u0645\u0651\u064E \u0647\u064F\u0648\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0636\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 62, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0646\u064E\u0627\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0623\u064E\u064A\u06E1\u0646\u064E \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0632\u06E1\u0639\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062D\u064E\u0642\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u063A\u06E1\u0648\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0648\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627 \u063A\u064E\u0648\u064E\u064A\u06E1\u0646\u064E\u0627\u06D6 \u062A\u064E\u0628\u064E\u0631\u0651\u064E\u0623\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u064A\u0651\u064E\u0627\u0646\u064E\u0627 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u062F\u064E\u0639\u064E\u0648\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0623\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E\u06DA \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0646\u064E\u0627\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0645\u064E\u0627\u0630\u064E\u0627\u0653 \u0623\u064E\u062C\u064E\u0628\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 66, text: "\u0641\u064E\u0639\u064E\u0645\u0650\u064A\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E2\u0628\u064E\u0627\u0653\u0621\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u062A\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646 \u062A\u064E\u0627\u0628\u064E \u0648\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 68, text: "\u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064E \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u062E\u06E1\u062A\u064E\u0627\u0631\u064F\u06D7 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u0650\u064A\u064E\u0631\u064E\u0629\u064F\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649\u0670 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064F\u0643\u0650\u0646\u0651\u064F \u0635\u064F\u062F\u064F\u0648\u0631\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0639\u06E1\u0644\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064F \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646 \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0633\u064E\u0631\u06E1\u0645\u064E\u062F\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0645\u064E\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0643\u064F\u0645 \u0628\u0650\u0636\u0650\u064A\u064E\u0627\u0653\u0621\u064D\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646 \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0633\u064E\u0631\u06E1\u0645\u064E\u062F\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0645\u064E\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0643\u064F\u0645 \u0628\u0650\u0644\u064E\u064A\u06E1\u0644\u0656 \u062A\u064E\u0633\u06E1\u0643\u064F\u0646\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u0650\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0648\u064E\u0645\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6 \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0644\u0650\u062A\u064E\u0633\u06E1\u0643\u064F\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0644\u0650\u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 74, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0646\u064E\u0627\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0623\u064E\u064A\u06E1\u0646\u064E \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0632\u06E1\u0639\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 75, text: "\u0648\u064E\u0646\u064E\u0632\u064E\u0639\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u0657\u0627 \u0641\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0647\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0628\u064F\u0631\u06E1\u0647\u064E\u0670\u0646\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0639\u064E\u0644\u0650\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0642\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0641\u064E\u0628\u064E\u063A\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064F\u0646\u064F\u0648\u0632\u0650 \u0645\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0645\u064E\u0641\u064E\u0627\u062A\u0650\u062D\u064E\u0647\u064F\u06E5 \u0644\u064E\u062A\u064E\u0646\u064F\u0648\u0653\u0623\u064F \u0628\u0650\u0671\u0644\u06E1\u0639\u064F\u0635\u06E1\u0628\u064E\u0629\u0650 \u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0648\u0651\u064E\u0629\u0650 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u06E5 \u0642\u064E\u0648\u06E1\u0645\u064F\u0647\u064F\u06E5 \u0644\u064E\u0627 \u062A\u064E\u0641\u06E1\u0631\u064E\u062D\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0641\u064E\u0631\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 77, text: "\u0648\u064E\u0671\u0628\u06E1\u062A\u064E\u063A\u0650 \u0641\u0650\u064A\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u0633\u064E \u0646\u064E\u0635\u0650\u064A\u0628\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0623\u064E\u062D\u06E1\u0633\u0650\u0646 \u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u063A\u0650 \u0671\u0644\u06E1\u0641\u064E\u0633\u064E\u0627\u062F\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 78, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u062A\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u0650\u0644\u06E1\u0645\u064D \u0639\u0650\u0646\u062F\u0650\u064A\u0653\u06DA \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u062F\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064F\u0648\u0646\u0650 \u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0645\u0650\u0646\u06E1\u0647\u064F \u0642\u064F\u0648\u0651\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F \u062C\u064E\u0645\u06E1\u0639\u0657\u0627\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F \u0639\u064E\u0646 \u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 79, text: "\u0641\u064E\u062E\u064E\u0631\u064E\u062C\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0641\u0650\u064A \u0632\u0650\u064A\u0646\u064E\u062A\u0650\u0647\u0650\u06E6\u06D6 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E \u0644\u064E\u0646\u064E\u0627 \u0645\u0650\u062B\u06E1\u0644\u064E \u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0642\u064E\u0670\u0631\u064F\u0648\u0646\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0630\u064F\u0648 \u062D\u064E\u0638\u0651\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 80, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064E \u0648\u064E\u064A\u06E1\u0644\u064E\u0643\u064F\u0645\u06E1 \u062B\u064E\u0648\u064E\u0627\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u0650\u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0644\u064E\u0642\u0651\u064E\u0649\u0670\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0641\u064E\u062E\u064E\u0633\u064E\u0641\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0628\u0650\u062F\u064E\u0627\u0631\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0641\u0650\u0626\u064E\u0629\u0656 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u062A\u064E\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 82, text: "\u0648\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0645\u064E\u0646\u0651\u064E\u0648\u06E1\u0627\u0652 \u0645\u064E\u0643\u064E\u0627\u0646\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0633\u0650 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u064A\u06E1\u0643\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u06D6 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u0645\u0651\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0644\u064E\u062E\u064E\u0633\u064E\u0641\u064E \u0628\u0650\u0646\u064E\u0627\u06D6 \u0648\u064E\u064A\u06E1\u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064F \u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0647\u064E\u0627 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0639\u064F\u0644\u064F\u0648\u0651\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u0641\u064E\u0633\u064E\u0627\u062F\u0657\u0627\u06DA \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 84, text: "\u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0650 \u0641\u064E\u0644\u064E\u0647\u064F\u06E5 \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0650 \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u062C\u06E1\u0632\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 85, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u064E\u0631\u064E\u0636\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0644\u064E\u0631\u064E\u0627\u0653\u062F\u0651\u064F\u0643\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0639\u064E\u0627\u062F\u0656\u06DA \u0642\u064F\u0644 \u0631\u0651\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 86, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u062A\u064E\u0631\u06E1\u062C\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064F\u0644\u06E1\u0642\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0638\u064E\u0647\u0650\u064A\u0631\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 87, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0646\u0651\u064E\u0643\u064E \u0639\u064E\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0630\u06E1 \u0623\u064F\u0646\u0632\u0650\u0644\u064E\u062A\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0648\u064E\u0671\u062F\u06E1\u0639\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 88, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u064E\u06D8 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06DA \u0643\u064F\u0644\u0651\u064F \u0634\u064E\u064A\u06E1\u0621\u064D \u0647\u064E\u0627\u0644\u0650\u0643\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u062C\u06E1\u0647\u064E\u0647\u064F\u06E5\u06DA \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064F \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }] }, { id: 29, name: "\u0627\u0644\u0639\u0646\u0643\u0628\u0648\u062A", transliteration: "Al-'Ankabut", type: "meccan", total_verses: 69, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0645\u0653" }, { id: 2, text: "\u0623\u064E\u062D\u064E\u0633\u0650\u0628\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0623\u064E\u0646 \u064A\u064F\u062A\u06E1\u0631\u064E\u0643\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0641\u06E1\u062A\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0641\u064E\u062A\u064E\u0646\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0644\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0635\u064E\u062F\u064E\u0642\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 4, text: "\u0623\u064E\u0645\u06E1 \u062D\u064E\u0633\u0650\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u0623\u064E\u0646 \u064A\u064E\u0633\u06E1\u0628\u0650\u0642\u064F\u0648\u0646\u064E\u0627\u06DA \u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0627\u0652 \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0623\u064E\u062C\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0623\u0653\u062A\u0656\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 6, text: "\u0648\u064E\u0645\u064E\u0646 \u062C\u064E\u0670\u0647\u064E\u062F\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u062C\u064E\u0670\u0647\u0650\u062F\u064F \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u063A\u064E\u0646\u0650\u064A\u0651\u064C \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0646\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u064E\u0646\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0646\u064E\u062C\u06E1\u0632\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u0648\u064E\u0648\u064E\u0635\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0628\u0650\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0647\u0650 \u062D\u064F\u0633\u06E1\u0646\u0657\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062C\u064E\u0670\u0647\u064E\u062F\u064E\u0627\u0643\u064E \u0644\u0650\u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064E \u0628\u0650\u064A \u0645\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u065E \u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u0639\u06E1\u0647\u064F\u0645\u064E\u0627\u0653\u06DA \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0646\u064F\u062F\u06E1\u062E\u0650\u0644\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064F\u0648\u0630\u0650\u064A\u064E \u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0639\u064E\u0644\u064E \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0643\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u062C\u064E\u0627\u0653\u0621\u064E \u0646\u064E\u0635\u06E1\u0631\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0646\u0651\u064E \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1\u06DA \u0623\u064E\u0648\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0628\u0650\u0645\u064E\u0627 \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0644\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0633\u064E\u0628\u0650\u064A\u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u0644\u06E1\u0646\u064E\u062D\u06E1\u0645\u0650\u0644\u06E1 \u062E\u064E\u0637\u064E\u0670\u064A\u064E\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0628\u0650\u062D\u064E\u0670\u0645\u0650\u0644\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u062E\u064E\u0637\u064E\u0670\u064A\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0648\u064E\u0644\u064E\u064A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F\u0646\u0651\u064E \u0623\u064E\u062B\u06E1\u0642\u064E\u0627\u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u062B\u06E1\u0642\u064E\u0627\u0644\u0657\u0627 \u0645\u0651\u064E\u0639\u064E \u0623\u064E\u062B\u06E1\u0642\u064E\u0627\u0644\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u064A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0646\u0651\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0639\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0646\u064F\u0648\u062D\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0641\u064E\u0644\u064E\u0628\u0650\u062B\u064E \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064E\u0644\u06E1\u0641\u064E \u0633\u064E\u0646\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u062E\u064E\u0645\u06E1\u0633\u0650\u064A\u0646\u064E \u0639\u064E\u0627\u0645\u0657\u0627 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0637\u0651\u064F\u0648\u0641\u064E\u0627\u0646\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u0638\u064E\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0641\u064E\u0623\u064E\u0646\u062C\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u0633\u0651\u064E\u0641\u0650\u064A\u0646\u064E\u0629\u0650 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 16, text: "\u0648\u064E\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0647\u064F\u06D6 \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0648\u06E1\u062B\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u062A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F\u0648\u0646\u064E \u0625\u0650\u0641\u06E1\u0643\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u0650\u0632\u06E1\u0642\u0657\u0627 \u0641\u064E\u0671\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0648\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0647\u064F \u0648\u064E\u0671\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5\u0653\u06D6 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0627\u0652 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0623\u064F\u0645\u064E\u0645\u065E \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 19, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u064A\u064F\u0628\u06E1\u062F\u0650\u0626\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u064E \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0639\u0650\u064A\u062F\u064F\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0633\u0650\u064A\u0631\u065E" }, { id: 20, text: "\u0642\u064F\u0644\u06E1 \u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0628\u064E\u062F\u064E\u0623\u064E \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u064E\u06DA \u062B\u064F\u0645\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0646\u0634\u0650\u0626\u064F \u0671\u0644\u0646\u0651\u064E\u0634\u06E1\u0623\u064E\u0629\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 21, text: "\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0631\u06E1\u062D\u064E\u0645\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0642\u06E1\u0644\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u0656" }, { id: 23, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u0642\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u06E6\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064E\u0626\u0650\u0633\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u064A \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 24, text: "\u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u062C\u064E\u0648\u064E\u0627\u0628\u064E \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0647\u064F \u0623\u064E\u0648\u06E1 \u062D\u064E\u0631\u0651\u0650\u0642\u064F\u0648\u0647\u064F \u0641\u064E\u0623\u064E\u0646\u062C\u064E\u0649\u0670\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0648\u06E1\u062B\u064E\u0670\u0646\u0657\u0627 \u0645\u0651\u064E\u0648\u064E\u062F\u0651\u064E\u0629\u064E \u0628\u064E\u064A\u06E1\u0646\u0650\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645 \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0648\u064E\u064A\u064E\u0644\u06E1\u0639\u064E\u0646\u064F \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u0657\u0627 \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0643\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0640\u0670\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u06DE\u0641\u064E\u0640\u0654\u064E\u0627\u0645\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0644\u064F\u0648\u0637\u065E\u06D8 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064F\u0647\u064E\u0627\u062C\u0650\u0631\u064C \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u064A\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 27, text: "\u0648\u064E\u0648\u064E\u0647\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u0650\u0647\u0650 \u0671\u0644\u0646\u0651\u064F\u0628\u064F\u0648\u0651\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0623\u064E\u062C\u06E1\u0631\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u0648\u064E\u0644\u064F\u0648\u0637\u064B\u0627 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u064E \u0645\u064E\u0627 \u0633\u064E\u0628\u064E\u0642\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 29, text: "\u0623\u064E\u0626\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u062C\u064E\u0627\u0644\u064E \u0648\u064E\u062A\u064E\u0642\u06E1\u0637\u064E\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u064E \u0648\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0646\u064E\u0627\u062F\u0650\u064A\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u064E\u06D6 \u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u062C\u064E\u0648\u064E\u0627\u0628\u064E \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0626\u06E1\u062A\u0650\u0646\u064E\u0627 \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u0646\u0635\u064F\u0631\u06E1\u0646\u0650\u064A \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 31, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0646\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0628\u0650\u0671\u0644\u06E1\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064F\u0647\u06E1\u0644\u0650\u0643\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0638\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064F\u0648\u0637\u0657\u0627\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0646 \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0644\u064E\u0646\u064F\u0646\u064E\u062C\u0651\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0646\u064E\u0627 \u0644\u064F\u0648\u0637\u0657\u0627 \u0633\u0650\u064A\u0653\u0621\u064E \u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0636\u064E\u0627\u0642\u064E \u0628\u0650\u0647\u0650\u0645\u06E1 \u0630\u064E\u0631\u06E1\u0639\u0657\u0627\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0641\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u06E1 \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064F\u0646\u064E\u062C\u0651\u064F\u0648\u0643\u064E \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E\u0643\u064E \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 34, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064F\u0646\u0632\u0650\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0650 \u0631\u0650\u062C\u06E1\u0632\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0633\u064F\u0642\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F \u062A\u0651\u064E\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u064E\u06E2 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0657 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0648\u064E\u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u062F\u06E1\u064A\u064E\u0646\u064E \u0623\u064E\u062E\u064E\u0627\u0647\u064F\u0645\u06E1 \u0634\u064F\u0639\u064E\u064A\u06E1\u0628\u0657\u0627 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0631\u06E1\u062C\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062B\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 37, text: "\u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u062C\u06E1\u0641\u064E\u0629\u064F \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062F\u064E\u0627\u0631\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0670\u062B\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u0648\u064E\u0639\u064E\u0627\u062F\u0657\u0627 \u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064E\u0627\u0652 \u0648\u064E\u0642\u064E\u062F \u062A\u0651\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0632\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0635\u064E\u062F\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0633\u06E1\u062A\u064E\u0628\u06E1\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 39, text: "\u0648\u064E\u0642\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0648\u064E\u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0647\u064E\u0670\u0645\u064E\u0670\u0646\u064E\u06D6 \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0648\u0633\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0633\u064E\u0670\u0628\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 40, text: "\u0641\u064E\u0643\u064F\u0644\u0651\u064B\u0627 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0628\u0650\u0630\u064E\u0646\u06E2\u0628\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062D\u064E\u0627\u0635\u0650\u0628\u0657\u0627 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F \u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u062D\u064E\u0629\u064F \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0633\u064E\u0641\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 41, text: "\u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0646\u0643\u064E\u0628\u064F\u0648\u062A\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E\u062A\u06E1 \u0628\u064E\u064A\u06E1\u062A\u0657\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0648\u06E1\u0647\u064E\u0646\u064E \u0671\u0644\u06E1\u0628\u064F\u064A\u064F\u0648\u062A\u0650 \u0644\u064E\u0628\u064E\u064A\u06E1\u062A\u064F \u0671\u0644\u06E1\u0639\u064E\u0646\u0643\u064E\u0628\u064F\u0648\u062A\u0650\u06DA \u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 43, text: "\u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u064F \u0646\u064E\u0636\u06E1\u0631\u0650\u0628\u064F\u0647\u064E\u0627 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650\u06D6 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 45, text: "\u0671\u062A\u06E1\u0644\u064F \u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0623\u064E\u0642\u0650\u0645\u0650 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u062A\u064E\u0646\u06E1\u0647\u064E\u0649\u0670 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0641\u064E\u062D\u06E1\u0634\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650\u06D7 \u0648\u064E\u0644\u064E\u0630\u0650\u0643\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064E\u0635\u06E1\u0646\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u06DE\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0647\u0650\u064A\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0644\u064E\u0670\u0647\u064F\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0644\u064E\u0670\u0647\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0670\u062D\u0650\u062F\u065E \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E\u06DA \u0641\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u0650\u0646\u06E1 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062C\u06E1\u062D\u064E\u062F\u064F \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u062A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u064F\u0637\u0651\u064F\u0647\u064F\u06E5 \u0628\u0650\u064A\u064E\u0645\u0650\u064A\u0646\u0650\u0643\u064E\u06D6 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0671\u0631\u06E1\u062A\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u0645\u064F\u0628\u06E1\u0637\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0628\u064E\u0644\u06E1 \u0647\u064F\u0648\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u06E2 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u065E \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064E\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062C\u06E1\u062D\u064E\u062F\u064F \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06DA \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u064F \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 51, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u06E1\u0641\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u064A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0648\u064E\u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0642\u064F\u0644\u06E1 \u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0634\u064E\u0647\u0650\u064A\u062F\u0657\u0627\u06D6 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u0648\u064E\u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u062C\u064E\u0644\u065E \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649 \u0644\u0651\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F\u06DA \u0648\u064E\u0644\u064E\u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0644\u064E\u0645\u064F\u062D\u0650\u064A\u0637\u064E\u0629\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 55, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u063A\u06E1\u0634\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0645\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650 \u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u064A\u064E\u0670\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0631\u06E1\u0636\u0650\u064A \u0648\u064E\u0670\u0633\u0650\u0639\u064E\u0629\u065E \u0641\u064E\u0625\u0650\u064A\u0651\u064E\u0640\u0670\u064A\u064E \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u0650" }, { id: 57, text: "\u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0630\u064E\u0627\u0653\u0626\u0650\u0642\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650\u06D6 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0646\u064F\u0628\u064E\u0648\u0651\u0650\u0626\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u063A\u064F\u0631\u064E\u0641\u0657\u0627 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0646\u0650\u0639\u06E1\u0645\u064E \u0623\u064E\u062C\u06E1\u0631\u064F \u0671\u0644\u06E1\u0639\u064E\u0670\u0645\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 59, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0648\u064E\u0643\u064E\u0623\u064E\u064A\u0651\u0650\u0646 \u0645\u0651\u0650\u0646 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0656 \u0644\u0651\u064E\u0627 \u062A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F \u0631\u0650\u0632\u06E1\u0642\u064E\u0647\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F\u0647\u064E\u0627 \u0648\u064E\u0625\u0650\u064A\u0651\u064E\u0627\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 61, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F \u0644\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 63, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u0646\u0651\u064E\u0632\u0651\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u062D\u06E1\u064A\u064E\u0627 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627 \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0642\u064F\u0644\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0648\u064E\u0645\u064E\u0627 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u064E\u0647\u06E1\u0648\u065E \u0648\u064E\u0644\u064E\u0639\u0650\u0628\u065E\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E \u0644\u064E\u0647\u0650\u064A\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u064E\u0627\u0646\u064F\u06DA \u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0643\u0650\u0628\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u062F\u064E\u0639\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u0650\u064A\u0646\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0646\u064E\u062C\u0651\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0644\u0650\u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u064A\u064E\u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0627\u0652\u06DA \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u062D\u064E\u0631\u064E\u0645\u064B\u0627 \u0621\u064E\u0627\u0645\u0650\u0646\u0657\u0627 \u0648\u064E\u064A\u064F\u062A\u064E\u062E\u064E\u0637\u0651\u064E\u0641\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0645\u0650\u0646\u06E1 \u062D\u064E\u0648\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0623\u064E\u0641\u064E\u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0648\u064E\u0628\u0650\u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u06E5\u0653\u06DA \u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0641\u0650\u064A \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0645\u064E\u062B\u06E1\u0648\u0657\u0649 \u0644\u0651\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 69, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0646\u064E\u0627 \u0644\u064E\u0646\u064E\u0647\u06E1\u062F\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0633\u064F\u0628\u064F\u0644\u064E\u0646\u064E\u0627\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }] }, { id: 30, name: "\u0627\u0644\u0631\u0648\u0645", transliteration: "Ar-Rum", type: "meccan", total_verses: 60, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0645\u0653" }, { id: 2, text: "\u063A\u064F\u0644\u0650\u0628\u064E\u062A\u0650 \u0671\u0644\u0631\u0651\u064F\u0648\u0645\u064F" }, { id: 3, text: "\u0641\u0650\u064A\u0653 \u0623\u064E\u062F\u06E1\u0646\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u063A\u064E\u0644\u064E\u0628\u0650\u0647\u0650\u0645\u06E1 \u0633\u064E\u064A\u064E\u063A\u06E1\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0641\u0650\u064A \u0628\u0650\u0636\u06E1\u0639\u0650 \u0633\u0650\u0646\u0650\u064A\u0646\u064E\u06D7 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u064F\u06DA \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064E\u0641\u06E1\u0631\u064E\u062D\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0628\u0650\u0646\u064E\u0635\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u064A\u064E\u0646\u0635\u064F\u0631\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 6, text: "\u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0644\u064E\u0627 \u064A\u064F\u062E\u06E1\u0644\u0650\u0641\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0639\u06E1\u062F\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0638\u064E\u0670\u0647\u0650\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0647\u064F\u0645\u06E1 \u063A\u064E\u0670\u0641\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06D7 \u0645\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u0650\u0644\u0650\u0642\u064E\u0627\u0653\u064A\u0655\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0634\u064E\u062F\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0642\u064F\u0648\u0651\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u062B\u064E\u0627\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0639\u064E\u0645\u064E\u0631\u064F\u0648\u0647\u064E\u0627\u0653 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u0639\u064E\u0645\u064E\u0631\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650\u06D6 \u0641\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u062B\u064F\u0645\u0651\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0633\u064E\u0640\u0670\u0653\u0640\u0654\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0623\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0628\u06E1\u062F\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u064E \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0639\u0650\u064A\u062F\u064F\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0642\u064F\u0648\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u064A\u064F\u0628\u06E1\u0644\u0650\u0633\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0634\u064F\u0641\u064E\u0639\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0642\u064F\u0648\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064E\u062A\u064E\u0641\u064E\u0631\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0631\u064E\u0648\u06E1\u0636\u064E\u0629\u0656 \u064A\u064F\u062D\u06E1\u0628\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0644\u0650\u0642\u064E\u0627\u0653\u064A\u0655\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0645\u064F\u062D\u06E1\u0636\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0641\u064E\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u0650\u064A\u0646\u064E \u062A\u064F\u0645\u06E1\u0633\u064F\u0648\u0646\u064E \u0648\u064E\u062D\u0650\u064A\u0646\u064E \u062A\u064F\u0635\u06E1\u0628\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0639\u064E\u0634\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u062D\u0650\u064A\u0646\u064E \u062A\u064F\u0638\u06E1\u0647\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u064A\u0651\u0650\u062A\u0650 \u0648\u064E\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u0651\u0650\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u0650 \u0648\u064E\u064A\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062A\u064F\u062E\u06E1\u0631\u064E\u062C\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062A\u064F\u0631\u064E\u0627\u0628\u0656 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u064E\u0634\u064E\u0631\u065E \u062A\u064E\u0646\u062A\u064E\u0634\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u0644\u0651\u0650\u062A\u064E\u0633\u06E1\u0643\u064F\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0648\u064E\u062F\u0651\u064E\u0629\u0657 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u064B\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u062E\u064E\u0644\u06E1\u0642\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u062E\u06E1\u062A\u0650\u0644\u064E\u0670\u0641\u064F \u0623\u064E\u0644\u06E1\u0633\u0650\u0646\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0644\u06E1\u0648\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 23, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646\u064E\u0627\u0645\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u064A\u064F\u0631\u0650\u064A\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u0631\u06E1\u0642\u064E \u062E\u064E\u0648\u06E1\u0641\u0657\u0627 \u0648\u064E\u0637\u064E\u0645\u064E\u0639\u0657\u0627 \u0648\u064E\u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0645\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6\u06DA \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0630\u064E\u0627 \u062F\u064E\u0639\u064E\u0627\u0643\u064F\u0645\u06E1 \u062F\u064E\u0639\u06E1\u0648\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0648\u064E\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0643\u064F\u0644\u0651\u065E \u0644\u0651\u064E\u0647\u064F\u06E5 \u0642\u064E\u0670\u0646\u0650\u062A\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0628\u06E1\u062F\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u064E \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0639\u0650\u064A\u062F\u064F\u0647\u064F\u06E5 \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0647\u06E1\u0648\u064E\u0646\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0648\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0649\u0670 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 28, text: "\u0636\u064E\u0631\u064E\u0628\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u062B\u064E\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0647\u064E\u0644 \u0644\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E \u0641\u0650\u064A \u0645\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u065E \u062A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u062E\u0650\u064A\u0641\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064F\u0641\u064E\u0635\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0628\u064E\u0644\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u0656\u06D6 \u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0640\u0670\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0641\u064E\u0623\u064E\u0642\u0650\u0645\u06E1 \u0648\u064E\u062C\u06E1\u0647\u064E\u0643\u064E \u0644\u0650\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u062D\u064E\u0646\u0650\u064A\u0641\u0657\u0627\u06DA \u0641\u0650\u0637\u06E1\u0631\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0641\u064E\u0637\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06DA \u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u062F\u0650\u064A\u0644\u064E \u0644\u0650\u062E\u064E\u0644\u06E1\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064F \u0671\u0644\u06E1\u0642\u064E\u064A\u0651\u0650\u0645\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u06DE\u0645\u064F\u0646\u0650\u064A\u0628\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0647\u064F \u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u064E\u0631\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u062F\u0650\u064A\u0646\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0634\u0650\u064A\u064E\u0639\u0657\u0627\u06D6 \u0643\u064F\u0644\u0651\u064F \u062D\u0650\u0632\u06E1\u0628\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u062F\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0641\u064E\u0631\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0636\u064F\u0631\u0651\u065E \u062F\u064E\u0639\u064E\u0648\u06E1\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0646\u0650\u064A\u0628\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0630\u064E\u0627\u0642\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u064B \u0625\u0650\u0630\u064E\u0627 \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0644\u0650\u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1\u06DA \u0641\u064E\u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0627\u0652 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0623\u064E\u0645\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0641\u064E\u0647\u064F\u0648\u064E \u064A\u064E\u062A\u064E\u0643\u064E\u0644\u0651\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0630\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0641\u064E\u0631\u0650\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0635\u0650\u0628\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0642\u06E1\u0646\u064E\u0637\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0641\u064E\u0640\u0654\u064E\u0627\u062A\u0650 \u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u062D\u064E\u0642\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u06E1\u0645\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0628\u06E1\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u062C\u06E1\u0647\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u0650\u0628\u0657\u0627 \u0644\u0651\u0650\u064A\u064E\u0631\u06E1\u0628\u064F\u0648\u064E\u0627\u0652 \u0641\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u0628\u064F\u0648\u0627\u0652 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0632\u064E\u0643\u064E\u0648\u0670\u0629\u0656 \u062A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u062C\u06E1\u0647\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0636\u06E1\u0639\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0631\u064E\u0632\u064E\u0642\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0645\u0650\u064A\u062A\u064F\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u062D\u06E1\u064A\u0650\u064A\u0643\u064F\u0645\u06E1\u06D6 \u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0645\u0650\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649\u0670 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 41, text: "\u0638\u064E\u0647\u064E\u0631\u064E \u0671\u0644\u06E1\u0641\u064E\u0633\u064E\u0627\u062F\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u0650\u064A\u064F\u0630\u0650\u064A\u0642\u064E\u0647\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0642\u064F\u0644\u06E1 \u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06DA \u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 43, text: "\u0641\u064E\u0623\u064E\u0642\u0650\u0645\u06E1 \u0648\u064E\u062C\u06E1\u0647\u064E\u0643\u064E \u0644\u0650\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0671\u0644\u06E1\u0642\u064E\u064A\u0651\u0650\u0645\u0650 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u064A\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u0645\u064E\u0631\u064E\u062F\u0651\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064E\u0635\u0651\u064E\u062F\u0651\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0645\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0643\u064F\u0641\u06E1\u0631\u064F\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0644\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0645\u06E1\u0647\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0644\u0650\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646 \u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0671\u0644\u0631\u0651\u0650\u064A\u064E\u0627\u062D\u064E \u0645\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064E\u0670\u062A\u0656 \u0648\u064E\u0644\u0650\u064A\u064F\u0630\u0650\u064A\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u0650\u062A\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064F \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u0650\u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0631\u064F\u0633\u064F\u0644\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0671\u0646\u062A\u064E\u0642\u064E\u0645\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u062C\u06E1\u0631\u064E\u0645\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u062D\u064E\u0642\u0651\u064B\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0646\u064E\u0635\u06E1\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064F \u0671\u0644\u0631\u0651\u0650\u064A\u064E\u0670\u062D\u064E \u0641\u064E\u062A\u064F\u062B\u0650\u064A\u0631\u064F \u0633\u064E\u062D\u064E\u0627\u0628\u0657\u0627 \u0641\u064E\u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0643\u064E\u064A\u06E1\u0641\u064E \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0647\u064F\u06E5 \u0643\u0650\u0633\u064E\u0641\u0657\u0627 \u0641\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0648\u064E\u062F\u06E1\u0642\u064E \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646\u06E1 \u062E\u0650\u0644\u064E\u0670\u0644\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0628\u06E1\u0634\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064F\u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0644\u064E\u0645\u064F\u0628\u06E1\u0644\u0650\u0633\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062B\u064E\u0670\u0631\u0650 \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u064A\u06E1\u0641\u064E \u064A\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0645\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 51, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0631\u0650\u064A\u062D\u0657\u0627 \u0641\u064E\u0631\u064E\u0623\u064E\u0648\u06E1\u0647\u064F \u0645\u064F\u0635\u06E1\u0641\u064E\u0631\u0651\u0657\u0627 \u0644\u0651\u064E\u0638\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0627 \u062A\u064F\u0633\u06E1\u0645\u0650\u0639\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0633\u06E1\u0645\u0650\u0639\u064F \u0671\u0644\u0635\u0651\u064F\u0645\u0651\u064E \u0671\u0644\u062F\u0651\u064F\u0639\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u0630\u064E\u0627 \u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0645\u064F\u062F\u06E1\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 53, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0628\u0650\u0647\u064E\u0670\u062F\u0650 \u0671\u0644\u06E1\u0639\u064F\u0645\u06E1\u064A\u0650 \u0639\u064E\u0646 \u0636\u064E\u0644\u064E\u0670\u0644\u064E\u062A\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0625\u0650\u0646 \u062A\u064F\u0633\u06E1\u0645\u0650\u0639\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u06DE\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0636\u064E\u0639\u06E1\u0641\u0656 \u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0639\u064E\u0644\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0636\u064E\u0639\u06E1\u0641\u0656 \u0642\u064F\u0648\u0651\u064E\u0629\u0657 \u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0639\u064E\u0644\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0642\u064F\u0648\u0651\u064E\u0629\u0656 \u0636\u064E\u0639\u06E1\u0641\u0657\u0627 \u0648\u064E\u0634\u064E\u064A\u06E1\u0628\u064E\u0629\u0657\u06DA \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u062F\u0650\u064A\u0631\u064F" }, { id: 55, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0642\u064F\u0648\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u064A\u064F\u0642\u06E1\u0633\u0650\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u0644\u064E\u0628\u0650\u062B\u064F\u0648\u0627\u0652 \u063A\u064E\u064A\u06E1\u0631\u064E \u0633\u064E\u0627\u0639\u064E\u0629\u0656\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064E \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064E \u0644\u064E\u0642\u064E\u062F\u06E1 \u0644\u064E\u0628\u0650\u062B\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0628\u064E\u0639\u06E1\u062B\u0650\u06D6 \u0641\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u0639\u06E1\u062B\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0641\u064E\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u06E1\u0630\u0650\u0631\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0633\u06E1\u062A\u064E\u0639\u06E1\u062A\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0636\u064E\u0631\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u062B\u064E\u0644\u0656\u06DA \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u062C\u0650\u0626\u06E1\u062A\u064E\u0647\u064F\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u0656 \u0644\u0651\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064F\u0628\u06E1\u0637\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0637\u06E1\u0628\u064E\u0639\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0625\u0650\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u065E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u062E\u0650\u0641\u0651\u064E\u0646\u0651\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }] }, { id: 31, name: "\u0644\u0642\u0645\u0627\u0646", transliteration: "Luqman", type: "meccan", total_verses: 34, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0645\u0653" }, { id: 2, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u0650" }, { id: 3, text: "\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 4, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0642\u0650\u064A\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u064A\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0647\u064F\u062F\u0657\u0649 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064E\u0634\u06E1\u062A\u064E\u0631\u0650\u064A \u0644\u064E\u0647\u06E1\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u062F\u0650\u064A\u062B\u0650 \u0644\u0650\u064A\u064F\u0636\u0650\u0644\u0651\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u0656 \u0648\u064E\u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E\u0647\u064E\u0627 \u0647\u064F\u0632\u064F\u0648\u064B\u0627\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u065E" }, { id: 7, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0645\u064F\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u0657\u0627 \u0643\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u06E1\u0647\u064E\u0627 \u0643\u064E\u0623\u064E\u0646\u0651\u064E \u0641\u0650\u064A\u0653 \u0623\u064F\u0630\u064F\u0646\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0642\u06E1\u0631\u0657\u0627\u06D6 \u0641\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u06E1\u0647\u064F \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u064D" }, { id: 8, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u064F \u0671\u0644\u0646\u0651\u064E\u0639\u0650\u064A\u0645\u0650" }, { id: 9, text: "\u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u0657\u0627\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 10, text: "\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u064E\u0645\u064E\u062F\u0656 \u062A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E\u0647\u064E\u0627\u06D6 \u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0631\u064E\u0648\u064E\u0670\u0633\u0650\u064A\u064E \u0623\u064E\u0646 \u062A\u064E\u0645\u0650\u064A\u062F\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u062B\u0651\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0656\u06DA \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0632\u064E\u0648\u06E1\u062C\u0656 \u0643\u064E\u0631\u0650\u064A\u0645\u064D" }, { id: 11, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u062E\u064E\u0644\u06E1\u0642\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0623\u064E\u0631\u064F\u0648\u0646\u0650\u064A \u0645\u064E\u0627\u0630\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u06DA \u0628\u064E\u0644\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 12, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0644\u064F\u0642\u06E1\u0645\u064E\u0670\u0646\u064E \u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0623\u064E\u0646\u0650 \u0671\u0634\u06E1\u0643\u064F\u0631\u06E1 \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0646\u0650\u064A\u0651\u064C \u062D\u064E\u0645\u0650\u064A\u062F\u065E" }, { id: 13, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u064F\u0642\u06E1\u0645\u064E\u0670\u0646\u064F \u0644\u0650\u0671\u0628\u06E1\u0646\u0650\u0647\u0650\u06E6 \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064E\u0639\u0650\u0638\u064F\u0647\u064F\u06E5 \u064A\u064E\u0670\u0628\u064F\u0646\u064E\u064A\u0651\u064E \u0644\u064E\u0627 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u06E1 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0634\u0651\u0650\u0631\u06E1\u0643\u064E \u0644\u064E\u0638\u064F\u0644\u06E1\u0645\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 14, text: "\u0648\u064E\u0648\u064E\u0635\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0628\u0650\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0647\u0650 \u062D\u064E\u0645\u064E\u0644\u064E\u062A\u06E1\u0647\u064F \u0623\u064F\u0645\u0651\u064F\u0647\u064F\u06E5 \u0648\u064E\u0647\u06E1\u0646\u064B\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0647\u06E1\u0646\u0656 \u0648\u064E\u0641\u0650\u0635\u064E\u0670\u0644\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A \u0639\u064E\u0627\u0645\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u0646\u0650 \u0671\u0634\u06E1\u0643\u064F\u0631\u06E1 \u0644\u0650\u064A \u0648\u064E\u0644\u0650\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0643\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 15, text: "\u0648\u064E\u0625\u0650\u0646 \u062C\u064E\u0670\u0647\u064E\u062F\u064E\u0627\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064E \u0628\u0650\u064A \u0645\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u065E \u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u0639\u06E1\u0647\u064F\u0645\u064E\u0627\u06D6 \u0648\u064E\u0635\u064E\u0627\u062D\u0650\u0628\u06E1\u0647\u064F\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0657\u0627\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0633\u064E\u0628\u0650\u064A\u0644\u064E \u0645\u064E\u0646\u06E1 \u0623\u064E\u0646\u064E\u0627\u0628\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E\u06DA \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u064A\u064E\u0670\u0628\u064F\u0646\u064E\u064A\u0651\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627\u0653 \u0625\u0650\u0646 \u062A\u064E\u0643\u064F \u0645\u0650\u062B\u06E1\u0642\u064E\u0627\u0644\u064E \u062D\u064E\u0628\u0651\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u0631\u06E1\u062F\u064E\u0644\u0656 \u0641\u064E\u062A\u064E\u0643\u064F\u0646 \u0641\u0650\u064A \u0635\u064E\u062E\u06E1\u0631\u064E\u0629\u064D \u0623\u064E\u0648\u06E1 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0623\u064E\u0648\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u064A\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u0647\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0637\u0650\u064A\u0641\u064C \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 17, text: "\u064A\u064E\u0670\u0628\u064F\u0646\u064E\u064A\u0651\u064E \u0623\u064E\u0642\u0650\u0645\u0650 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0623\u06E1\u0645\u064F\u0631\u06E1 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0650 \u0648\u064E\u0671\u0646\u06E1\u0647\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0643\u064E\u0631\u0650 \u0648\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0643\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0639\u064E\u0632\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u0650" }, { id: 18, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0635\u064E\u0639\u0651\u0650\u0631\u06E1 \u062E\u064E\u062F\u0651\u064E\u0643\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u06E1\u0634\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u064E\u0631\u064E\u062D\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0643\u064F\u0644\u0651\u064E \u0645\u064F\u062E\u06E1\u062A\u064E\u0627\u0644\u0656 \u0641\u064E\u062E\u064F\u0648\u0631\u0656" }, { id: 19, text: "\u0648\u064E\u0671\u0642\u06E1\u0635\u0650\u062F\u06E1 \u0641\u0650\u064A \u0645\u064E\u0634\u06E1\u064A\u0650\u0643\u064E \u0648\u064E\u0671\u063A\u06E1\u0636\u064F\u0636\u06E1 \u0645\u0650\u0646 \u0635\u064E\u0648\u06E1\u062A\u0650\u0643\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0646\u0643\u064E\u0631\u064E \u0671\u0644\u06E1\u0623\u064E\u0635\u06E1\u0648\u064E\u0670\u062A\u0650 \u0644\u064E\u0635\u064E\u0648\u06E1\u062A\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u0631\u0650" }, { id: 20, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0623\u064E\u0633\u06E1\u0628\u064E\u063A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0646\u0650\u0639\u064E\u0645\u064E\u0647\u064F\u06E5 \u0638\u064E\u0670\u0647\u0650\u0631\u064E\u0629\u0657 \u0648\u064E\u0628\u064E\u0627\u0637\u0650\u0646\u064E\u0629\u0657\u06D7 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u064E\u0646 \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F \u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u0656 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0644\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u064F\u0646\u0650\u064A\u0631\u0656" }, { id: 21, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u06E1 \u0646\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0645\u064E\u0627 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627\u0653\u06DA \u0623\u064E\u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u0633\u0651\u064E\u0639\u0650\u064A\u0631\u0650" }, { id: 22, text: "\u06DE\u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0633\u06E1\u0644\u0650\u0645\u06E1 \u0648\u064E\u062C\u06E1\u0647\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u065E \u0641\u064E\u0642\u064E\u062F\u0650 \u0671\u0633\u06E1\u062A\u064E\u0645\u06E1\u0633\u064E\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u0639\u064F\u0631\u06E1\u0648\u064E\u0629\u0650 \u0671\u0644\u06E1\u0648\u064F\u062B\u06E1\u0642\u064E\u0649\u0670\u06D7 \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u0650" }, { id: 23, text: "\u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0632\u064F\u0646\u0643\u064E \u0643\u064F\u0641\u06E1\u0631\u064F\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0646\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 24, text: "\u0646\u064F\u0645\u064E\u062A\u0651\u0650\u0639\u064F\u0647\u064F\u0645\u06E1 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0646\u064E\u0636\u06E1\u0637\u064E\u0631\u0651\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0630\u064E\u0627\u0628\u064D \u063A\u064E\u0644\u0650\u064A\u0638\u0656" }, { id: 25, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0642\u064F\u0644\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0646\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u062F\u064F" }, { id: 27, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u0650\u0646 \u0634\u064E\u062C\u064E\u0631\u064E\u0629\u064D \u0623\u064E\u0642\u06E1\u0644\u064E\u0670\u0645\u065E \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064F \u064A\u064E\u0645\u064F\u062F\u0651\u064F\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0633\u064E\u0628\u06E1\u0639\u064E\u0629\u064F \u0623\u064E\u0628\u06E1\u062D\u064F\u0631\u0656 \u0645\u0651\u064E\u0627 \u0646\u064E\u0641\u0650\u062F\u064E\u062A\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 28, text: "\u0645\u0651\u064E\u0627 \u062E\u064E\u0644\u06E1\u0642\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0628\u064E\u0639\u06E1\u062B\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0646\u064E\u0641\u06E1\u0633\u0656 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064F\u06E2 \u0628\u064E\u0635\u0650\u064A\u0631\u064C" }, { id: 29, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0648\u0644\u0650\u062C\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u064A\u064F\u0648\u0644\u0650\u062C\u064F \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E\u06D6 \u0643\u064F\u0644\u0651\u065E \u064A\u064E\u062C\u06E1\u0631\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 30, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0645\u064E\u0627 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650 \u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u064F \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u0643\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 31, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0628\u0650\u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u0650\u064A\u064F\u0631\u0650\u064A\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0635\u064E\u0628\u0651\u064E\u0627\u0631\u0656 \u0634\u064E\u0643\u064F\u0648\u0631\u0656" }, { id: 32, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u063A\u064E\u0634\u0650\u064A\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0648\u06E1\u062C\u065E \u0643\u064E\u0671\u0644\u0638\u0651\u064F\u0644\u064E\u0644\u0650 \u062F\u064E\u0639\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u0650\u064A\u0646\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0646\u064E\u062C\u0651\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u0650 \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064F\u0642\u06E1\u062A\u064E\u0635\u0650\u062F\u065E\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062C\u06E1\u062D\u064E\u062F\u064F \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064F\u0644\u0651\u064F \u062E\u064E\u062A\u0651\u064E\u0627\u0631\u0656 \u0643\u064E\u0641\u064F\u0648\u0631\u0656" }, { id: 33, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u062E\u06E1\u0634\u064E\u0648\u06E1\u0627\u0652 \u064A\u064E\u0648\u06E1\u0645\u0657\u0627 \u0644\u0651\u064E\u0627 \u064A\u064E\u062C\u06E1\u0632\u0650\u064A \u0648\u064E\u0627\u0644\u0650\u062F\u064C \u0639\u064E\u0646 \u0648\u064E\u0644\u064E\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0627 \u0645\u064E\u0648\u06E1\u0644\u064F\u0648\u062F\u064C \u0647\u064F\u0648\u064E \u062C\u064E\u0627\u0632\u064D \u0639\u064E\u0646 \u0648\u064E\u0627\u0644\u0650\u062F\u0650\u0647\u0650\u06E6 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u065E\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u063A\u064F\u0631\u0651\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u063A\u064F\u0631\u0651\u064E\u0646\u0651\u064E\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u063A\u064E\u0631\u064F\u0648\u0631\u064F" }, { id: 34, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0639\u0650\u0644\u06E1\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650 \u0648\u064E\u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u062B\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u0650\u06D6 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u062F\u06E1\u0631\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u065E \u0645\u0651\u064E\u0627\u0630\u064E\u0627 \u062A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F \u063A\u064E\u062F\u0657\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u062F\u06E1\u0631\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u064F\u06E2 \u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0623\u064E\u0631\u06E1\u0636\u0656 \u062A\u064E\u0645\u064F\u0648\u062A\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2" }] }, { id: 32, name: "\u0627\u0644\u0633\u062C\u062F\u0629", transliteration: "As-Sajdah", type: "meccan", total_verses: 30, verses: [{ id: 1, text: "\u0627\u0644\u0653\u0645\u0653" }, { id: 2, text: "\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 3, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u0650\u062A\u064F\u0646\u0630\u0650\u0631\u064E \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0630\u0650\u064A\u0631\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0641\u0650\u064A \u0633\u0650\u062A\u0651\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650\u06D6 \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u0634\u064E\u0641\u0650\u064A\u0639\u064D\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u064A\u064F\u062F\u064E\u0628\u0651\u0650\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0639\u06E1\u0631\u064F\u062C\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u0650\u064A \u064A\u064E\u0648\u06E1\u0645\u0656 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0642\u06E1\u062F\u064E\u0627\u0631\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u0644\u06E1\u0641\u064E \u0633\u064E\u0646\u064E\u0629\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u064F\u062F\u0651\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0670\u0644\u0650\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 7, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D \u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0628\u064E\u062F\u064E\u0623\u064E \u062E\u064E\u0644\u06E1\u0642\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u0650 \u0645\u0650\u0646 \u0637\u0650\u064A\u0646\u0656" }, { id: 8, text: "\u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0639\u064E\u0644\u064E \u0646\u064E\u0633\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0633\u064F\u0644\u064E\u0670\u0644\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0627\u0653\u0621\u0656 \u0645\u0651\u064E\u0647\u0650\u064A\u0646\u0656" }, { id: 9, text: "\u062B\u064F\u0645\u0651\u064E \u0633\u064E\u0648\u0651\u064E\u0649\u0670\u0647\u064F \u0648\u064E\u0646\u064E\u0641\u064E\u062E\u064E \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646 \u0631\u0651\u064F\u0648\u062D\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u0629\u064E\u06DA \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0636\u064E\u0644\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0641\u0650\u064A \u062E\u064E\u0644\u06E1\u0642\u0656 \u062C\u064E\u062F\u0650\u064A\u062F\u0650\u06ED\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645 \u0628\u0650\u0644\u0650\u0642\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u06DE\u0642\u064F\u0644\u06E1 \u064A\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670\u0643\u064F\u0645 \u0645\u0651\u064E\u0644\u064E\u0643\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0648\u064F\u0643\u0651\u0650\u0644\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u062A\u064E\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u0650 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E \u0646\u064E\u0627\u0643\u0650\u0633\u064F\u0648\u0627\u0652 \u0631\u064F\u0621\u064F\u0648\u0633\u0650\u0647\u0650\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0628\u06E1\u0635\u064E\u0631\u06E1\u0646\u064E\u0627 \u0648\u064E\u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0641\u064E\u0671\u0631\u06E1\u062C\u0650\u0639\u06E1\u0646\u064E\u0627 \u0646\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0635\u064E\u0670\u0644\u0650\u062D\u064B\u0627 \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u0650\u0626\u06E1\u0646\u064E\u0627 \u0644\u064E\u0623\u0653\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0643\u064F\u0644\u0651\u064E \u0646\u064E\u0641\u06E1\u0633\u064D \u0647\u064F\u062F\u064E\u0649\u0670\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u06E1 \u062D\u064E\u0642\u0651\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0645\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0623\u064E\u0645\u06E1\u0644\u064E\u0623\u064E\u0646\u0651\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0646\u064E\u0633\u0650\u064A\u062A\u064F\u0645\u06E1 \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E \u064A\u064E\u0648\u06E1\u0645\u0650\u0643\u064F\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u0633\u0650\u064A\u0646\u064E\u0670\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062E\u064F\u0644\u06E1\u062F\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627 \u0630\u064F\u0643\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627 \u062E\u064E\u0631\u0651\u064F\u0648\u0627\u0652\u06E4 \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627\u06E4 \u0648\u064E\u0633\u064E\u0628\u0651\u064E\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E\u06E9" }, { id: 16, text: "\u062A\u064E\u062A\u064E\u062C\u064E\u0627\u0641\u064E\u0649\u0670 \u062C\u064F\u0646\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064E\u0636\u064E\u0627\u062C\u0650\u0639\u0650 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645\u06E1 \u062E\u064E\u0648\u06E1\u0641\u0657\u0627 \u0648\u064E\u0637\u064E\u0645\u064E\u0639\u0657\u0627 \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0646\u064E\u0641\u06E1\u0633\u065E \u0645\u0651\u064E\u0627\u0653 \u0623\u064F\u062E\u06E1\u0641\u0650\u064A\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064F\u0631\u0651\u064E\u0629\u0650 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0656 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064E\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0657\u0627 \u0643\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0641\u064E\u0627\u0633\u0650\u0642\u0657\u0627\u06DA \u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u064F\u06E5\u0646\u064E" }, { id: 19, text: "\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0641\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u064F \u0671\u0644\u06E1\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670 \u0646\u064F\u0632\u064F\u0644\u064E\u06E2\u0627 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u064E\u0633\u064E\u0642\u064F\u0648\u0627\u0652 \u0641\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F\u06D6 \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u0627\u062F\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627\u0653 \u0623\u064F\u0639\u0650\u064A\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0644\u064E\u0646\u064F\u0630\u0650\u064A\u0642\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u06E1\u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670 \u062F\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u06E1\u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646 \u0630\u064F\u0643\u0651\u0650\u0631\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064E \u0639\u064E\u0646\u06E1\u0647\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u064F\u0646\u062A\u064E\u0642\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0646 \u0641\u0650\u064A \u0645\u0650\u0631\u06E1\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0644\u0651\u0650\u0642\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0647\u064F\u062F\u0657\u0649 \u0644\u0651\u0650\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E" }, { id: 24, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0626\u0650\u0645\u0651\u064E\u0629\u0657 \u064A\u064E\u0647\u06E1\u062F\u064F\u0648\u0646\u064E \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0646\u064E\u0627 \u0644\u064E\u0645\u0651\u064E\u0627 \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0647\u064F\u0648\u064E \u064A\u064E\u0641\u06E1\u0635\u0650\u0644\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0641\u0650\u064A\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0647\u06E1\u062F\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064F\u0648\u0646\u0650 \u064A\u064E\u0645\u06E1\u0634\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0645\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u0650\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u064D\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0627 \u0646\u064E\u0633\u064F\u0648\u0642\u064F \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0671\u0644\u06E1\u062C\u064F\u0631\u064F\u0632\u0650 \u0641\u064E\u0646\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0628\u0650\u0647\u0650\u06E6 \u0632\u064E\u0631\u06E1\u0639\u0657\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F \u0645\u0650\u0646\u06E1\u0647\u064F \u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0647\u064F\u0645\u06E1\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u062A\u064E\u0649\u0670 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0641\u064E\u062A\u06E1\u062D\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 29, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0641\u064E\u062A\u06E1\u062D\u0650 \u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0638\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0641\u064E\u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0646\u062A\u064E\u0638\u0650\u0631\u06E1 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0646\u062A\u064E\u0638\u0650\u0631\u064F\u0648\u0646\u064E" }] }, { id: 33, name: "\u0627\u0644\u0623\u062D\u0632\u0627\u0628", transliteration: "Al-Ahzab", type: "medinan", total_verses: 73, verses: [{ id: 1, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0671\u062A\u0651\u064E\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u0639\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 2, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 3, text: "\u0648\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u0650\u064A\u0644\u0657\u0627" }, { id: 4, text: "\u0645\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u0631\u064E\u062C\u064F\u0644\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0644\u06E1\u0628\u064E\u064A\u06E1\u0646\u0650 \u0641\u0650\u064A \u062C\u064E\u0648\u06E1\u0641\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0640\u0670\u0653\u0640\u0654\u0650\u064A \u062A\u064F\u0638\u064E\u0670\u0647\u0650\u0631\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0646\u0651\u064E \u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E \u0623\u064E\u062F\u06E1\u0639\u0650\u064A\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0644\u064F\u0643\u064F\u0645 \u0628\u0650\u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u064E" }, { id: 5, text: "\u0671\u062F\u06E1\u0639\u064F\u0648\u0647\u064F\u0645\u06E1 \u0644\u0650\u0623\u0653\u0628\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0647\u064F\u0648\u064E \u0623\u064E\u0642\u06E1\u0633\u064E\u0637\u064F \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0648\u064E\u0645\u064E\u0648\u064E\u0670\u0644\u0650\u064A\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062C\u064F\u0646\u064E\u0627\u062D\u065E \u0641\u0650\u064A\u0645\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0637\u064E\u0623\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u064E\u0645\u0651\u064E\u062F\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064B\u0627" }, { id: 6, text: "\u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0623\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064F\u0647\u064F\u06E5\u0653 \u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u064F\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u0650 \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0647\u064E\u0670\u062C\u0650\u0631\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0657\u0627\u06DA \u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u064E\u0633\u06E1\u0637\u064F\u0648\u0631\u0657\u0627" }, { id: 7, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u0650\u0646\u0643\u064E \u0648\u064E\u0645\u0650\u0646 \u0646\u0651\u064F\u0648\u062D\u0656 \u0648\u064E\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u0650 \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E\u06D6 \u0648\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u0650\u064A\u062B\u064E\u0670\u0642\u064B\u0627 \u063A\u064E\u0644\u0650\u064A\u0638\u0657\u0627" }, { id: 8, text: "\u0644\u0651\u0650\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E \u0639\u064E\u0646 \u0635\u0650\u062F\u06E1\u0642\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 9, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0643\u064F\u0645\u06E1 \u062C\u064F\u0646\u064F\u0648\u062F\u065E \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0631\u0650\u064A\u062D\u0657\u0627 \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u0657\u0627 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E\u0648\u06E1\u0647\u064E\u0627\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u064B\u0627" }, { id: 10, text: "\u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u0650\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0641\u064E\u0644\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0630\u06E1 \u0632\u064E\u0627\u063A\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F \u0648\u064E\u0628\u064E\u0644\u064E\u063A\u064E\u062A\u0650 \u0671\u0644\u06E1\u0642\u064F\u0644\u064F\u0648\u0628\u064F \u0671\u0644\u06E1\u062D\u064E\u0646\u064E\u0627\u062C\u0650\u0631\u064E \u0648\u064E\u062A\u064E\u0638\u064F\u0646\u0651\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0638\u0651\u064F\u0646\u064F\u0648\u0646\u064E\u0627\u06E0" }, { id: 11, text: "\u0647\u064F\u0646\u064E\u0627\u0644\u0650\u0643\u064E \u0671\u0628\u06E1\u062A\u064F\u0644\u0650\u064A\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0648\u064E\u0632\u064F\u0644\u06E1\u0632\u0650\u0644\u064F\u0648\u0627\u0652 \u0632\u0650\u0644\u06E1\u0632\u064E\u0627\u0644\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u0657\u0627" }, { id: 12, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u065E \u0645\u0651\u064E\u0627 \u0648\u064E\u0639\u064E\u062F\u064E\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u063A\u064F\u0631\u064F\u0648\u0631\u0657\u0627" }, { id: 13, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E\u062A \u0637\u0651\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0647\u06E1\u0644\u064E \u064A\u064E\u062B\u06E1\u0631\u0650\u0628\u064E \u0644\u064E\u0627 \u0645\u064F\u0642\u064E\u0627\u0645\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0630\u0650\u0646\u064F \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0625\u0650\u0646\u0651\u064E \u0628\u064F\u064A\u064F\u0648\u062A\u064E\u0646\u064E\u0627 \u0639\u064E\u0648\u06E1\u0631\u064E\u0629\u065E \u0648\u064E\u0645\u064E\u0627 \u0647\u0650\u064A\u064E \u0628\u0650\u0639\u064E\u0648\u06E1\u0631\u064E\u0629\u064D\u06D6 \u0625\u0650\u0646 \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u0631\u064E\u0627\u0631\u0657\u0627" }, { id: 14, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u062F\u064F\u062E\u0650\u0644\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0642\u06E1\u0637\u064E\u0627\u0631\u0650\u0647\u064E\u0627 \u062B\u064F\u0645\u0651\u064E \u0633\u064F\u0626\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u064E \u0644\u064E\u0623\u0653\u062A\u064E\u0648\u06E1\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0644\u064E\u0628\u0651\u064E\u062B\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u0650\u064A\u0631\u0657\u0627" }, { id: 15, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0644\u064E\u0627 \u064A\u064F\u0648\u064E\u0644\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062F\u06E1\u0628\u064E\u0670\u0631\u064E\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0647\u06E1\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0633\u06E1\u0640\u0654\u064F\u0648\u0644\u0657\u0627" }, { id: 16, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0646 \u064A\u064E\u0646\u0641\u064E\u0639\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u0650\u0631\u064E\u0627\u0631\u064F \u0625\u0650\u0646 \u0641\u064E\u0631\u064E\u0631\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650 \u0623\u064E\u0648\u0650 \u0671\u0644\u06E1\u0642\u064E\u062A\u06E1\u0644\u0650 \u0648\u064E\u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0627 \u062A\u064F\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 17, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646 \u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0639\u06E1\u0635\u0650\u0645\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 18, text: "\u06DE\u0642\u064E\u062F\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0639\u064E\u0648\u0651\u0650\u0642\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0627\u0653\u0626\u0650\u0644\u0650\u064A\u0646\u064E \u0644\u0650\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u0647\u064E\u0644\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0628\u064E\u0623\u06E1\u0633\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627" }, { id: 19, text: "\u0623\u064E\u0634\u0650\u062D\u0651\u064E\u0629\u064B \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u06E1\u062E\u064E\u0648\u06E1\u0641\u064F \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u062A\u064E\u062F\u064F\u0648\u0631\u064F \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u064F\u0647\u064F\u0645\u06E1 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u063A\u06E1\u0634\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0630\u064E\u0647\u064E\u0628\u064E \u0671\u0644\u06E1\u062E\u064E\u0648\u06E1\u0641\u064F \u0633\u064E\u0644\u064E\u0642\u064F\u0648\u0643\u064F\u0645 \u0628\u0650\u0623\u064E\u0644\u06E1\u0633\u0650\u0646\u064E\u0629\u064D \u062D\u0650\u062F\u064E\u0627\u062F\u064D \u0623\u064E\u0634\u0650\u062D\u0651\u064E\u0629\u064B \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u064E\u062D\u06E1\u0628\u064E\u0637\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0633\u0650\u064A\u0631\u0657\u0627" }, { id: 20, text: "\u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0630\u06E1\u0647\u064E\u0628\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u064F \u064A\u064E\u0648\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0628\u064E\u0627\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0628\u0650 \u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0642\u064E\u0670\u062A\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 21, text: "\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0631\u064E\u0633\u064F\u0648\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064F\u0633\u06E1\u0648\u064E\u0629\u064C \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u065E \u0644\u0651\u0650\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E \u0648\u064E\u0630\u064E\u0643\u064E\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627" }, { id: 22, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0621\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u064E\u0627 \u0648\u064E\u0639\u064E\u062F\u064E\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0635\u064E\u062F\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5\u06DA \u0648\u064E\u0645\u064E\u0627 \u0632\u064E\u0627\u062F\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u062A\u064E\u0633\u06E1\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 23, text: "\u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0631\u0650\u062C\u064E\u0627\u0644\u065E \u0635\u064E\u062F\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0639\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u06D6 \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u0642\u064E\u0636\u064E\u0649\u0670 \u0646\u064E\u062D\u06E1\u0628\u064E\u0647\u064F\u06E5 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0646\u062A\u064E\u0638\u0650\u0631\u064F\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u062F\u0651\u064E\u0644\u064F\u0648\u0627\u0652 \u062A\u064E\u0628\u06E1\u062F\u0650\u064A\u0644\u0657\u0627" }, { id: 24, text: "\u0644\u0651\u0650\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E \u0628\u0650\u0635\u0650\u062F\u06E1\u0642\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0648\u06E1 \u064A\u064E\u062A\u064F\u0648\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 25, text: "\u0648\u064E\u0631\u064E\u062F\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u063A\u064E\u064A\u06E1\u0638\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0646\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0671\u0644\u06E1\u0642\u0650\u062A\u064E\u0627\u0644\u064E\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064E\u0648\u0650\u064A\u0651\u064B\u0627 \u0639\u064E\u0632\u0650\u064A\u0632\u0657\u0627" }, { id: 26, text: "\u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0670\u0647\u064E\u0631\u064F\u0648\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u0650\u0646 \u0635\u064E\u064A\u064E\u0627\u0635\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0642\u064E\u0630\u064E\u0641\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0631\u0651\u064F\u0639\u06E1\u0628\u064E \u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u062A\u064E\u0623\u06E1\u0633\u0650\u0631\u064F\u0648\u0646\u064E \u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627" }, { id: 27, text: "\u0648\u064E\u0623\u064E\u0648\u06E1\u0631\u064E\u062B\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0631\u06E1\u0636\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u062F\u0650\u064A\u064E\u0670\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0631\u06E1\u0636\u0657\u0627 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0637\u064E\u0640\u0654\u064F\u0648\u0647\u064E\u0627\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u0657\u0627" }, { id: 28, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0642\u064F\u0644 \u0644\u0651\u0650\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0643\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0646\u0651\u064E \u062A\u064F\u0631\u0650\u062F\u06E1\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0632\u0650\u064A\u0646\u064E\u062A\u064E\u0647\u064E\u0627 \u0641\u064E\u062A\u064E\u0639\u064E\u0627\u0644\u064E\u064A\u06E1\u0646\u064E \u0623\u064F\u0645\u064E\u062A\u0651\u0650\u0639\u06E1\u0643\u064F\u0646\u0651\u064E \u0648\u064E\u0623\u064F\u0633\u064E\u0631\u0651\u0650\u062D\u06E1\u0643\u064F\u0646\u0651\u064E \u0633\u064E\u0631\u064E\u0627\u062D\u0657\u0627 \u062C\u064E\u0645\u0650\u064A\u0644\u0657\u0627" }, { id: 29, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0646\u0651\u064E \u062A\u064F\u0631\u0650\u062F\u06E1\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u062F\u0651\u064E\u0627\u0631\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0644\u0650\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u064E\u0670\u062A\u0650 \u0645\u0650\u0646\u0643\u064F\u0646\u0651\u064E \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 30, text: "\u064A\u064E\u0670\u0646\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650 \u0645\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650 \u0645\u0650\u0646\u0643\u064F\u0646\u0651\u064E \u0628\u0650\u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u0656 \u0645\u0651\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656 \u064A\u064F\u0636\u064E\u0670\u0639\u064E\u0641\u06E1 \u0644\u064E\u0647\u064E\u0627 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0636\u0650\u0639\u06E1\u0641\u064E\u064A\u06E1\u0646\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0633\u0650\u064A\u0631\u0657\u0627" }, { id: 31, text: "\u06DE\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0642\u06E1\u0646\u064F\u062A\u06E1 \u0645\u0650\u0646\u0643\u064F\u0646\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0646\u0651\u064F\u0624\u06E1\u062A\u0650\u0647\u064E\u0627\u0653 \u0623\u064E\u062C\u06E1\u0631\u064E\u0647\u064E\u0627 \u0645\u064E\u0631\u0651\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064E\u0627 \u0631\u0650\u0632\u06E1\u0642\u0657\u0627 \u0643\u064E\u0631\u0650\u064A\u0645\u0657\u0627" }, { id: 32, text: "\u064A\u064E\u0670\u0646\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650 \u0644\u064E\u0633\u06E1\u062A\u064F\u0646\u0651\u064E \u0643\u064E\u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0646\u0650 \u0671\u062A\u0651\u064E\u0642\u064E\u064A\u06E1\u062A\u064F\u0646\u0651\u064E\u06DA \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062E\u06E1\u0636\u064E\u0639\u06E1\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u0641\u064E\u064A\u064E\u0637\u06E1\u0645\u064E\u0639\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u0650\u064A \u0642\u064E\u0644\u06E1\u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0631\u064E\u0636\u065E \u0648\u064E\u0642\u064F\u0644\u06E1\u0646\u064E \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0645\u0651\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0657\u0627" }, { id: 33, text: "\u0648\u064E\u0642\u064E\u0631\u06E1\u0646\u064E \u0641\u0650\u064A \u0628\u064F\u064A\u064F\u0648\u062A\u0650\u0643\u064F\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0628\u064E\u0631\u0651\u064E\u062C\u06E1\u0646\u064E \u062A\u064E\u0628\u064E\u0631\u0651\u064F\u062C\u064E \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u0650\u064A\u0651\u064E\u0629\u0650 \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670\u06D6 \u0648\u064E\u0623\u064E\u0642\u0650\u0645\u06E1\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u0650\u064A\u0646\u064E \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u0639\u06E1\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064F\u0630\u06E1\u0647\u0650\u0628\u064E \u0639\u064E\u0646\u0643\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u0650\u062C\u06E1\u0633\u064E \u0623\u064E\u0647\u06E1\u0644\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u0650 \u0648\u064E\u064A\u064F\u0637\u064E\u0647\u0651\u0650\u0631\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0637\u06E1\u0647\u0650\u064A\u0631\u0657\u0627" }, { id: 34, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1\u0646\u064E \u0645\u064E\u0627 \u064A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0641\u0650\u064A \u0628\u064F\u064A\u064F\u0648\u062A\u0650\u0643\u064F\u0646\u0651\u064E \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0637\u0650\u064A\u0641\u064B\u0627 \u062E\u064E\u0628\u0650\u064A\u0631\u064B\u0627" }, { id: 35, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0670\u0646\u0650\u062A\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0670\u0646\u0650\u062A\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u062E\u064E\u0670\u0634\u0650\u0639\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u062E\u064E\u0670\u0634\u0650\u0639\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0635\u064E\u062F\u0651\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0635\u064E\u062F\u0651\u0650\u0642\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0653\u0626\u0650\u0645\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0653\u0626\u0650\u0645\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u0670\u0641\u0650\u0638\u0650\u064A\u0646\u064E \u0641\u064F\u0631\u064F\u0648\u062C\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u0670\u0641\u0650\u0638\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u0630\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0671\u0644\u0630\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u064E\u0670\u062A\u0650 \u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 36, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0656 \u0648\u064E\u0644\u064E\u0627 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0629\u064D \u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0636\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u0645\u06E1\u0631\u064B\u0627 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u0650\u064A\u064E\u0631\u064E\u0629\u064F \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0635\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064E \u0636\u064E\u0644\u064E\u0670\u0644\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 37, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u062A\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0645\u06E1\u0633\u0650\u0643\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0632\u064E\u0648\u06E1\u062C\u064E\u0643\u064E \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u062A\u064F\u062E\u06E1\u0641\u0650\u064A \u0641\u0650\u064A \u0646\u064E\u0641\u06E1\u0633\u0650\u0643\u064E \u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064F\u0628\u06E1\u062F\u0650\u064A\u0647\u0650 \u0648\u064E\u062A\u064E\u062E\u06E1\u0634\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u062D\u064E\u0642\u0651\u064F \u0623\u064E\u0646 \u062A\u064E\u062E\u06E1\u0634\u064E\u0649\u0670\u0647\u064F\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0642\u064E\u0636\u064E\u0649\u0670 \u0632\u064E\u064A\u06E1\u062F\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0637\u064E\u0631\u0657\u0627 \u0632\u064E\u0648\u0651\u064E\u062C\u06E1\u0646\u064E\u0670\u0643\u064E\u0647\u064E\u0627 \u0644\u0650\u0643\u064E\u064A\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u062D\u064E\u0631\u064E\u062C\u065E \u0641\u0650\u064A\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650 \u0623\u064E\u062F\u06E1\u0639\u0650\u064A\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0636\u064E\u0648\u06E1\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0637\u064E\u0631\u0657\u0627\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0645\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0641\u06E1\u0639\u064F\u0648\u0644\u0657\u0627" }, { id: 38, text: "\u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650 \u0645\u0650\u0646\u06E1 \u062D\u064E\u0631\u064E\u062C\u0656 \u0641\u0650\u064A\u0645\u064E\u0627 \u0641\u064E\u0631\u064E\u0636\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u06E5\u06D6 \u0633\u064F\u0646\u0651\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0644\u064E\u0648\u06E1\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0623\u064E\u0645\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0642\u064E\u062F\u064E\u0631\u0657\u0627 \u0645\u0651\u064E\u0642\u06E1\u062F\u064F\u0648\u0631\u064B\u0627" }, { id: 39, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0628\u064E\u0644\u0651\u0650\u063A\u064F\u0648\u0646\u064E \u0631\u0650\u0633\u064E\u0670\u0644\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u064E \u0623\u064E\u062D\u064E\u062F\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06D7 \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0633\u0650\u064A\u0628\u0657\u0627" }, { id: 40, text: "\u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u064F\u062D\u064E\u0645\u0651\u064E\u062F\u064C \u0623\u064E\u0628\u064E\u0627\u0653 \u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u0650\u062C\u064E\u0627\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u062E\u064E\u0627\u062A\u064E\u0645\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 41, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0630\u0650\u0643\u06E1\u0631\u0657\u0627 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627" }, { id: 42, text: "\u0648\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0647\u064F \u0628\u064F\u0643\u06E1\u0631\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0635\u0650\u064A\u0644\u064B\u0627" }, { id: 43, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0635\u064E\u0644\u0651\u0650\u064A \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u062A\u064F\u0647\u064F\u06E5 \u0644\u0650\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064F\u0648\u0631\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0631\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 44, text: "\u062A\u064E\u062D\u0650\u064A\u0651\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0644\u06E1\u0642\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0633\u064E\u0644\u064E\u0670\u0645\u065E\u06DA \u0648\u064E\u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0657\u0627 \u0643\u064E\u0631\u0650\u064A\u0645\u0657\u0627" }, { id: 45, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0634\u064E\u0670\u0647\u0650\u062F\u0657\u0627 \u0648\u064E\u0645\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u0657\u0627 \u0648\u064E\u0646\u064E\u0630\u0650\u064A\u0631\u0657\u0627" }, { id: 46, text: "\u0648\u064E\u062F\u064E\u0627\u0639\u0650\u064A\u064B\u0627 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u0647\u0650\u06E6 \u0648\u064E\u0633\u0650\u0631\u064E\u0627\u062C\u0657\u0627 \u0645\u0651\u064F\u0646\u0650\u064A\u0631\u0657\u0627" }, { id: 47, text: "\u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0636\u06E1\u0644\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 48, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u0639\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u062F\u064E\u0639\u06E1 \u0623\u064E\u0630\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u0650\u064A\u0644\u0657\u0627" }, { id: 49, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0646\u064E\u0643\u064E\u062D\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u062B\u064F\u0645\u0651\u064E \u0637\u064E\u0644\u0651\u064E\u0642\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u062A\u064E\u0645\u064E\u0633\u0651\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u062F\u0651\u064E\u0629\u0656 \u062A\u064E\u0639\u06E1\u062A\u064E\u062F\u0651\u064F\u0648\u0646\u064E\u0647\u064E\u0627\u06D6 \u0641\u064E\u0645\u064E\u062A\u0651\u0650\u0639\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0633\u064E\u0631\u0651\u0650\u062D\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0633\u064E\u0631\u064E\u0627\u062D\u0657\u0627 \u062C\u064E\u0645\u0650\u064A\u0644\u0657\u0627" }, { id: 50, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u062D\u06E1\u0644\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064E \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u0640\u0670\u062A\u0650\u064A\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064E \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u064A\u064E\u0645\u0650\u064A\u0646\u064F\u0643\u064E \u0645\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0641\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0628\u064E\u0646\u064E\u0627\u062A\u0650 \u0639\u064E\u0645\u0651\u0650\u0643\u064E \u0648\u064E\u0628\u064E\u0646\u064E\u0627\u062A\u0650 \u0639\u064E\u0645\u0651\u064E\u0640\u0670\u062A\u0650\u0643\u064E \u0648\u064E\u0628\u064E\u0646\u064E\u0627\u062A\u0650 \u062E\u064E\u0627\u0644\u0650\u0643\u064E \u0648\u064E\u0628\u064E\u0646\u064E\u0627\u062A\u0650 \u062E\u064E\u0670\u0644\u064E\u0670\u062A\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0640\u0670\u062A\u0650\u064A \u0647\u064E\u0627\u062C\u064E\u0631\u06E1\u0646\u064E \u0645\u064E\u0639\u064E\u0643\u064E \u0648\u064E\u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u0629\u0657 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0629\u064B \u0625\u0650\u0646 \u0648\u064E\u0647\u064E\u0628\u064E\u062A\u06E1 \u0646\u064E\u0641\u06E1\u0633\u064E\u0647\u064E\u0627 \u0644\u0650\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0623\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0646\u0643\u0650\u062D\u064E\u0647\u064E\u0627 \u062E\u064E\u0627\u0644\u0650\u0635\u064E\u0629\u0657 \u0644\u0651\u064E\u0643\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E\u06D7 \u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0641\u064E\u0631\u064E\u0636\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0647\u064F\u0645\u06E1 \u0644\u0650\u0643\u064E\u064A\u06E1\u0644\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u062D\u064E\u0631\u064E\u062C\u065E\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 51, text: "\u06DE\u062A\u064F\u0631\u06E1\u062C\u0650\u064A \u0645\u064E\u0646 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u062A\u064F\u0640\u0654\u06E1\u0648\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u064E\u0646 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0648\u064E\u0645\u064E\u0646\u0650 \u0671\u0628\u06E1\u062A\u064E\u063A\u064E\u064A\u06E1\u062A\u064E \u0645\u0650\u0645\u0651\u064E\u0646\u06E1 \u0639\u064E\u0632\u064E\u0644\u06E1\u062A\u064E \u0641\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064E\u0642\u064E\u0631\u0651\u064E \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u064F\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u0651\u064E \u0648\u064E\u064A\u064E\u0631\u06E1\u0636\u064E\u064A\u06E1\u0646\u064E \u0628\u0650\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064E\u0647\u064F\u0646\u0651\u064E \u0643\u064F\u0644\u0651\u064F\u0647\u064F\u0646\u0651\u064E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 52, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u062D\u0650\u0644\u0651\u064F \u0644\u064E\u0643\u064E \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u064F \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0628\u064E\u062F\u0651\u064E\u0644\u064E \u0628\u0650\u0647\u0650\u0646\u0651\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0656 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0639\u06E1\u062C\u064E\u0628\u064E\u0643\u064E \u062D\u064F\u0633\u06E1\u0646\u064F\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u064A\u064E\u0645\u0650\u064A\u0646\u064F\u0643\u064E\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0631\u0651\u064E\u0642\u0650\u064A\u0628\u0657\u0627" }, { id: 53, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0628\u064F\u064A\u064F\u0648\u062A\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u0624\u06E1\u0630\u064E\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0637\u064E\u0639\u064E\u0627\u0645\u064D \u063A\u064E\u064A\u06E1\u0631\u064E \u0646\u064E\u0670\u0638\u0650\u0631\u0650\u064A\u0646\u064E \u0625\u0650\u0646\u064E\u0649\u0670\u0647\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u06E1 \u0625\u0650\u0630\u064E\u0627 \u062F\u064F\u0639\u0650\u064A\u062A\u064F\u0645\u06E1 \u0641\u064E\u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0637\u064E\u0639\u0650\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0671\u0646\u062A\u064E\u0634\u0650\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0627 \u0645\u064F\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u0646\u0650\u0633\u0650\u064A\u0646\u064E \u0644\u0650\u062D\u064E\u062F\u0650\u064A\u062B\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064E \u064A\u064F\u0624\u06E1\u0630\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064E \u0641\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062D\u06E1\u064A\u0650\u06E6 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u062D\u06E1\u064A\u0650\u06E6 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0645\u064E\u062A\u064E\u0670\u0639\u0657\u0627 \u0641\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u0650 \u062D\u0650\u062C\u064E\u0627\u0628\u0656\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0637\u06E1\u0647\u064E\u0631\u064F \u0644\u0650\u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0646\u0651\u064E\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064F\u0624\u06E1\u0630\u064F\u0648\u0627\u0652 \u0631\u064E\u0633\u064F\u0648\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u0646\u0643\u0650\u062D\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0628\u064E\u062F\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0638\u0650\u064A\u0645\u064B\u0627" }, { id: 54, text: "\u0625\u0650\u0646 \u062A\u064F\u0628\u06E1\u062F\u064F\u0648\u0627\u0652 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627 \u0623\u064E\u0648\u06E1 \u062A\u064F\u062E\u06E1\u0641\u064F\u0648\u0647\u064F \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 55, text: "\u0644\u0651\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u062E\u064E\u0648\u064E\u0670\u062A\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627 \u0646\u0650\u0633\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627 \u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0647\u064F\u0646\u0651\u064E\u06D7 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u064B\u0627" }, { id: 56, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u062A\u064E\u0647\u064F\u06E5 \u064A\u064F\u0635\u064E\u0644\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u06DA \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0635\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0633\u064E\u0644\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u062A\u064E\u0633\u06E1\u0644\u0650\u064A\u0645\u064B\u0627" }, { id: 57, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0630\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0644\u064E\u0639\u064E\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u0657\u0627" }, { id: 58, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0624\u06E1\u0630\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0645\u064E\u0627 \u0671\u0643\u06E1\u062A\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652 \u0641\u064E\u0642\u064E\u062F\u0650 \u0671\u062D\u06E1\u062A\u064E\u0645\u064E\u0644\u064F\u0648\u0627\u0652 \u0628\u064F\u0647\u06E1\u062A\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0625\u0650\u062B\u06E1\u0645\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 59, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0642\u064F\u0644 \u0644\u0651\u0650\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0643\u064E \u0648\u064E\u0628\u064E\u0646\u064E\u0627\u062A\u0650\u0643\u064E \u0648\u064E\u0646\u0650\u0633\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u064A\u064F\u062F\u06E1\u0646\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u0645\u0650\u0646 \u062C\u064E\u0644\u064E\u0670\u0628\u0650\u064A\u0628\u0650\u0647\u0650\u0646\u0651\u064E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064F\u0639\u06E1\u0631\u064E\u0641\u06E1\u0646\u064E \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0630\u064E\u064A\u06E1\u0646\u064E\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 60, text: "\u06DE\u0644\u0651\u064E\u0626\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0646\u062A\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u065E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u062C\u0650\u0641\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u0644\u064E\u0646\u064F\u063A\u06E1\u0631\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0628\u0650\u0647\u0650\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064F\u062C\u064E\u0627\u0648\u0650\u0631\u064F\u0648\u0646\u064E\u0643\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 61, text: "\u0645\u0651\u064E\u0644\u06E1\u0639\u064F\u0648\u0646\u0650\u064A\u0646\u064E\u06D6 \u0623\u064E\u064A\u06E1\u0646\u064E\u0645\u064E\u0627 \u062B\u064F\u0642\u0650\u0641\u064F\u0648\u0653\u0627\u0652 \u0623\u064F\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0648\u064E\u0642\u064F\u062A\u0651\u0650\u0644\u064F\u0648\u0627\u0652 \u062A\u064E\u0642\u06E1\u062A\u0650\u064A\u0644\u0657\u0627" }, { id: 62, text: "\u0633\u064F\u0646\u0651\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0644\u064E\u0648\u06E1\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0648\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0644\u0650\u0633\u064F\u0646\u0651\u064E\u0629\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0628\u06E1\u062F\u0650\u064A\u0644\u0657\u0627" }, { id: 63, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650\u06D6 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0639\u0650\u0644\u06E1\u0645\u064F\u0647\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u062F\u06E1\u0631\u0650\u064A\u0643\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0642\u064E\u0631\u0650\u064A\u0628\u064B\u0627" }, { id: 64, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0639\u064E\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u0639\u0650\u064A\u0631\u064B\u0627" }, { id: 65, text: "\u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06D6 \u0644\u0651\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 66, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064F\u0642\u064E\u0644\u0651\u064E\u0628\u064F \u0648\u064F\u062C\u064F\u0648\u0647\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E\u0627\u06E0" }, { id: 67, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627 \u0633\u064E\u0627\u062F\u064E\u062A\u064E\u0646\u064E\u0627 \u0648\u064E\u0643\u064F\u0628\u064E\u0631\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0641\u064E\u0623\u064E\u0636\u064E\u0644\u0651\u064F\u0648\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u064E\u0627\u06E0" }, { id: 68, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u0636\u0650\u0639\u06E1\u0641\u064E\u064A\u06E1\u0646\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u064E\u0639\u06E1\u0646\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u0657\u0627" }, { id: 69, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0630\u064E\u0648\u06E1\u0627\u0652 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0641\u064E\u0628\u064E\u0631\u0651\u064E\u0623\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0645\u0651\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u062C\u0650\u064A\u0647\u0657\u0627" }, { id: 70, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0633\u064E\u062F\u0650\u064A\u062F\u0657\u0627" }, { id: 71, text: "\u064A\u064F\u0635\u06E1\u0644\u0650\u062D\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0630\u064F\u0646\u064F\u0648\u0628\u064E\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0637\u0650\u0639\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0641\u064E\u0627\u0632\u064E \u0641\u064E\u0648\u06E1\u0632\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u064B\u0627" }, { id: 72, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0639\u064E\u0631\u064E\u0636\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0645\u064E\u0627\u0646\u064E\u0629\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u0650 \u0641\u064E\u0623\u064E\u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u062D\u06E1\u0645\u0650\u0644\u06E1\u0646\u064E\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0634\u06E1\u0641\u064E\u0642\u06E1\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u062D\u064E\u0645\u064E\u0644\u064E\u0647\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0638\u064E\u0644\u064F\u0648\u0645\u0657\u0627 \u062C\u064E\u0647\u064F\u0648\u0644\u0657\u0627" }, { id: 73, text: "\u0644\u0651\u0650\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u064E\u0670\u062A\u0650 \u0648\u064E\u064A\u064E\u062A\u064F\u0648\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064E\u06E2\u0627" }] }, { id: 34, name: "\u0633\u0628\u0625", transliteration: "Saba", type: "meccan", total_verses: 54, verses: [{ id: 1, text: "\u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 2, text: "\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u064A\u064E\u0644\u0650\u062C\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0646\u0632\u0650\u0644\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0631\u064F\u062C\u064F \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F" }, { id: 3, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F\u06D6 \u0642\u064F\u0644\u06E1 \u0628\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0670\u0644\u0650\u0645\u0650 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650\u06D6 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0632\u064F\u0628\u064F \u0639\u064E\u0646\u06E1\u0647\u064F \u0645\u0650\u062B\u06E1\u0642\u064E\u0627\u0644\u064F \u0630\u064E\u0631\u0651\u064E\u0629\u0656 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u063A\u064E\u0631\u064F \u0645\u0650\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 4, text: "\u0644\u0651\u0650\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0631\u0650\u0632\u06E1\u0642\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u065E" }, { id: 5, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0633\u064E\u0639\u064E\u0648\u06E1 \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0645\u064F\u0639\u064E\u0670\u062C\u0650\u0632\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u0650\u062C\u06E1\u0632\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 6, text: "\u0648\u064E\u064A\u064E\u0631\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u062F\u0650" }, { id: 7, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0647\u064E\u0644\u06E1 \u0646\u064E\u062F\u064F\u0644\u0651\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u062C\u064F\u0644\u0656 \u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0645\u064F\u0632\u0651\u0650\u0642\u06E1\u062A\u064F\u0645\u06E1 \u0643\u064F\u0644\u0651\u064E \u0645\u064F\u0645\u064E\u0632\u0651\u064E\u0642\u064D \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0641\u0650\u064A \u062E\u064E\u0644\u06E1\u0642\u0656 \u062C\u064E\u062F\u0650\u064A\u062F\u064D" }, { id: 8, text: "\u0623\u064E\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u064B\u0627 \u0623\u064E\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062C\u0650\u0646\u0651\u064E\u0629\u064F\u06E2\u06D7 \u0628\u064E\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0648\u064E\u0671\u0644\u0636\u0651\u064E\u0644\u064E\u0670\u0644\u0650 \u0671\u0644\u06E1\u0628\u064E\u0639\u0650\u064A\u062F\u0650" }, { id: 9, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u06E1\u0641\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0625\u0650\u0646 \u0646\u0651\u064E\u0634\u064E\u0623\u06E1 \u0646\u064E\u062E\u06E1\u0633\u0650\u0641\u06E1 \u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0623\u064E\u0648\u06E1 \u0646\u064F\u0633\u06E1\u0642\u0650\u0637\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0643\u0650\u0633\u064E\u0641\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0639\u064E\u0628\u06E1\u062F\u0656 \u0645\u0651\u064F\u0646\u0650\u064A\u0628\u0656" }, { id: 10, text: "\u06DE\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0645\u0650\u0646\u0651\u064E\u0627 \u0641\u064E\u0636\u06E1\u0644\u0657\u0627\u06D6 \u064A\u064E\u0670\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0623\u064E\u0648\u0651\u0650\u0628\u0650\u064A \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u064E\u06D6 \u0648\u064E\u0623\u064E\u0644\u064E\u0646\u0651\u064E\u0627 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u062F\u0650\u064A\u062F\u064E" }, { id: 11, text: "\u0623\u064E\u0646\u0650 \u0671\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0633\u064E\u0670\u0628\u0650\u063A\u064E\u0670\u062A\u0656 \u0648\u064E\u0642\u064E\u062F\u0651\u0650\u0631\u06E1 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0631\u06E1\u062F\u0650\u06D6 \u0648\u064E\u0671\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0627\u0652 \u0635\u064E\u0670\u0644\u0650\u062D\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 12, text: "\u0648\u064E\u0644\u0650\u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0671\u0644\u0631\u0651\u0650\u064A\u062D\u064E \u063A\u064F\u062F\u064F\u0648\u0651\u064F\u0647\u064E\u0627 \u0634\u064E\u0647\u06E1\u0631\u065E \u0648\u064E\u0631\u064E\u0648\u064E\u0627\u062D\u064F\u0647\u064E\u0627 \u0634\u064E\u0647\u06E1\u0631\u065E\u06D6 \u0648\u064E\u0623\u064E\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0642\u0650\u0637\u06E1\u0631\u0650\u06D6 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0632\u0650\u063A\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u0646\u064E\u0627 \u0646\u064F\u0630\u0650\u0642\u06E1\u0647\u064F \u0645\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u0633\u0651\u064E\u0639\u0650\u064A\u0631\u0650" }, { id: 13, text: "\u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646 \u0645\u0651\u064E\u062D\u064E\u0670\u0631\u0650\u064A\u0628\u064E \u0648\u064E\u062A\u064E\u0645\u064E\u0670\u062B\u0650\u064A\u0644\u064E \u0648\u064E\u062C\u0650\u0641\u064E\u0627\u0646\u0656 \u0643\u064E\u0671\u0644\u06E1\u062C\u064E\u0648\u064E\u0627\u0628\u0650 \u0648\u064E\u0642\u064F\u062F\u064F\u0648\u0631\u0656 \u0631\u0651\u064E\u0627\u0633\u0650\u064A\u064E\u0670\u062A\u064D\u06DA \u0671\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0644\u064E \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0634\u064F\u0643\u06E1\u0631\u0657\u0627\u06DA \u0648\u064E\u0642\u064E\u0644\u0650\u064A\u0644\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A\u064E \u0671\u0644\u0634\u0651\u064E\u0643\u064F\u0648\u0631\u064F" }, { id: 14, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0642\u064E\u0636\u064E\u064A\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E \u0645\u064E\u0627 \u062F\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F \u0645\u0650\u0646\u0633\u064E\u0623\u064E\u062A\u064E\u0647\u064F\u06E5\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062E\u064E\u0631\u0651\u064E \u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064F \u0623\u064E\u0646 \u0644\u0651\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u064E \u0645\u064E\u0627 \u0644\u064E\u0628\u0650\u062B\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0647\u0650\u064A\u0646\u0650" }, { id: 15, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0633\u064E\u0628\u064E\u0625\u0656 \u0641\u0650\u064A \u0645\u064E\u0633\u06E1\u0643\u064E\u0646\u0650\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u065E\u06D6 \u062C\u064E\u0646\u0651\u064E\u062A\u064E\u0627\u0646\u0650 \u0639\u064E\u0646 \u064A\u064E\u0645\u0650\u064A\u0646\u0656 \u0648\u064E\u0634\u0650\u0645\u064E\u0627\u0644\u0656\u06D6 \u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0631\u0651\u0650\u0632\u06E1\u0642\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5\u06DA \u0628\u064E\u0644\u06E1\u062F\u064E\u0629\u065E \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0629\u065E \u0648\u064E\u0631\u064E\u0628\u0651\u064C \u063A\u064E\u0641\u064F\u0648\u0631\u065E" }, { id: 16, text: "\u0641\u064E\u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0633\u064E\u064A\u06E1\u0644\u064E \u0671\u0644\u06E1\u0639\u064E\u0631\u0650\u0645\u0650 \u0648\u064E\u0628\u064E\u062F\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u062C\u064E\u0646\u0651\u064E\u062A\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0630\u064E\u0648\u064E\u0627\u062A\u064E\u064A\u06E1 \u0623\u064F\u0643\u064F\u0644\u064D \u062E\u064E\u0645\u06E1\u0637\u0656 \u0648\u064E\u0623\u064E\u062B\u06E1\u0644\u0656 \u0648\u064E\u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u0650\u0646 \u0633\u0650\u062F\u06E1\u0631\u0656 \u0642\u064E\u0644\u0650\u064A\u0644\u0656" }, { id: 17, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0647\u064E\u0644\u06E1 \u0646\u064F\u062C\u064E\u0670\u0632\u0650\u064A\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0643\u064E\u0641\u064F\u0648\u0631\u064E" }, { id: 18, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0628\u064E\u0670\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0642\u064F\u0631\u0657\u0649 \u0638\u064E\u0670\u0647\u0650\u0631\u064E\u0629\u0657 \u0648\u064E\u0642\u064E\u062F\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u064A\u06E1\u0631\u064E\u06D6 \u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064E\u064A\u064E\u0627\u0644\u0650\u064A\u064E \u0648\u064E\u0623\u064E\u064A\u0651\u064E\u0627\u0645\u064B\u0627 \u0621\u064E\u0627\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 19, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0628\u064E\u0670\u0639\u0650\u062F\u06E1 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u0633\u06E1\u0641\u064E\u0627\u0631\u0650\u0646\u064E\u0627 \u0648\u064E\u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0623\u064E\u062D\u064E\u0627\u062F\u0650\u064A\u062B\u064E \u0648\u064E\u0645\u064E\u0632\u0651\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0643\u064F\u0644\u0651\u064E \u0645\u064F\u0645\u064E\u0632\u0651\u064E\u0642\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0635\u064E\u0628\u0651\u064E\u0627\u0631\u0656 \u0634\u064E\u0643\u064F\u0648\u0631\u0656" }, { id: 20, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0635\u064E\u062F\u0651\u064E\u0642\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064F \u0638\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0641\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u064E\u0631\u0650\u064A\u0642\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0645\u0650\u0645\u0651\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656\u06D7 \u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u062D\u064E\u0641\u0650\u064A\u0638\u065E" }, { id: 22, text: "\u0642\u064F\u0644\u0650 \u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0632\u064E\u0639\u064E\u0645\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u062B\u06E1\u0642\u064E\u0627\u0644\u064E \u0630\u064E\u0631\u0651\u064E\u0629\u0656 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650\u0645\u064E\u0627 \u0645\u0650\u0646 \u0634\u0650\u0631\u06E1\u0643\u0656 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0638\u064E\u0647\u0650\u064A\u0631\u0656" }, { id: 23, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u0641\u064E\u0639\u064F \u0671\u0644\u0634\u0651\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u064F \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u0645\u064E\u0646\u06E1 \u0623\u064E\u0630\u0650\u0646\u064E \u0644\u064E\u0647\u064F\u06E5\u06DA \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0641\u064F\u0632\u0651\u0650\u0639\u064E \u0639\u064E\u0646 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0630\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u0643\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 24, text: "\u06DE\u0642\u064F\u0644\u06E1 \u0645\u064E\u0646 \u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0625\u0650\u064A\u0651\u064E\u0627\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0647\u064F\u062F\u064B\u0649 \u0623\u064E\u0648\u06E1 \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 25, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0627 \u062A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062C\u06E1\u0631\u064E\u0645\u06E1\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F \u0639\u064E\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u062C\u06E1\u0645\u064E\u0639\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0641\u06E1\u062A\u064E\u062D\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u062A\u0651\u064E\u0627\u062D\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 27, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064F\u0648\u0646\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0644\u06E1\u062D\u064E\u0642\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E\u06D6 \u0643\u064E\u0644\u0651\u064E\u0627\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 28, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0627\u0653\u0641\u0651\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u064E\u0634\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0646\u064E\u0630\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u062A\u064E\u0649\u0670 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0648\u064E\u0639\u06E1\u062F\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0642\u064F\u0644 \u0644\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u064A\u0639\u064E\u0627\u062F\u064F \u064A\u064E\u0648\u06E1\u0645\u0656 \u0644\u0651\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0640\u0654\u06E1\u062E\u0650\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1\u0647\u064F \u0633\u064E\u0627\u0639\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0642\u06E1\u062F\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0646 \u0646\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0648\u064E\u0644\u064E\u0627 \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650\u06D7 \u0648\u064E\u0644\u064E\u0648\u06E1 \u062A\u064E\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0648\u06E1\u0642\u064F\u0648\u0641\u064F\u0648\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u064D \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064F\u0636\u06E1\u0639\u0650\u0641\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064F\u0636\u06E1\u0639\u0650\u0641\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0635\u064E\u062F\u064E\u062F\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u062F\u064E \u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06D6 \u0628\u064E\u0644\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064F\u0636\u06E1\u0639\u0650\u0641\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u06E1 \u0645\u064E\u0643\u06E1\u0631\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0625\u0650\u0630\u06E1 \u062A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u0646\u0651\u064E\u0643\u06E1\u0641\u064F\u0631\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646\u062F\u064E\u0627\u062F\u0657\u0627\u06DA \u0648\u064E\u0623\u064E\u0633\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u062F\u064E\u0627\u0645\u064E\u0629\u064E \u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E\u06DA \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u063A\u06E1\u0644\u064E\u0670\u0644\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0646\u064E\u0627\u0642\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652\u06D6 \u0647\u064E\u0644\u06E1 \u064A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0630\u0650\u064A\u0631\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0645\u064F\u062A\u06E1\u0631\u064E\u0641\u064F\u0648\u0647\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0657\u0627 \u0648\u064E\u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u0657\u0627 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u0645\u064F\u0639\u064E\u0630\u0651\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 36, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062A\u064F\u0642\u064E\u0631\u0651\u0650\u0628\u064F\u0643\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E\u0646\u064E\u0627 \u0632\u064F\u0644\u06E1\u0641\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u0636\u0651\u0650\u0639\u06E1\u0641\u0650 \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u063A\u064F\u0631\u064F\u0641\u064E\u0670\u062A\u0650 \u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0633\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0645\u064F\u0639\u064E\u0670\u062C\u0650\u0632\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0645\u064F\u062D\u06E1\u0636\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F \u0644\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0647\u064F\u0648\u064E \u064A\u064F\u062E\u06E1\u0644\u0650\u0641\u064F\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0632\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 40, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u062D\u06E1\u0634\u064F\u0631\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u0650\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0623\u064E\u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u064A\u0651\u064E\u0627\u0643\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 41, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0648\u064E\u0644\u0650\u064A\u0651\u064F\u0646\u064E\u0627 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u0645\u06D6 \u0628\u064E\u0644\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064E\u06D6 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0641\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0628\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645\u06E1 \u0644\u0650\u0628\u064E\u0639\u06E1\u0636\u0656 \u0646\u0651\u064E\u0641\u06E1\u0639\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0636\u064E\u0631\u0651\u0657\u0627 \u0648\u064E\u0646\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u062C\u064F\u0644\u065E \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u064A\u064E\u0635\u064F\u062F\u0651\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0641\u06E1\u0643\u065E \u0645\u0651\u064F\u0641\u06E1\u062A\u064E\u0631\u0657\u0649\u06DA \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 44, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0643\u064F\u062A\u064F\u0628\u0656 \u064A\u064E\u062F\u06E1\u0631\u064F\u0633\u064F\u0648\u0646\u064E\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0642\u064E\u0628\u06E1\u0644\u064E\u0643\u064E \u0645\u0650\u0646 \u0646\u0651\u064E\u0630\u0650\u064A\u0631\u0656" }, { id: 45, text: "\u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064F\u0648\u0627\u0652 \u0645\u0650\u0639\u06E1\u0634\u064E\u0627\u0631\u064E \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0631\u064F\u0633\u064F\u0644\u0650\u064A\u06D6 \u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0646\u064E\u0643\u0650\u064A\u0631\u0650" }, { id: 46, text: "\u06DE\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0639\u0650\u0638\u064F\u0643\u064F\u0645 \u0628\u0650\u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u064D\u06D6 \u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0645\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u062B\u06E1\u0646\u064E\u0649\u0670 \u0648\u064E\u0641\u064F\u0631\u064E\u0670\u062F\u064E\u0649\u0670 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0645\u064E\u0627 \u0628\u0650\u0635\u064E\u0627\u062D\u0650\u0628\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062C\u0650\u0646\u0651\u064E\u0629\u064D\u06DA \u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0656 \u0634\u064E\u062F\u0650\u064A\u062F\u0656" }, { id: 47, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0627 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0656 \u0641\u064E\u0647\u064F\u0648\u064E \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u065E" }, { id: 48, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u064A\u064E\u0642\u06E1\u0630\u0650\u0641\u064F \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0639\u064E\u0644\u0651\u064E\u0640\u0670\u0645\u064F \u0671\u0644\u06E1\u063A\u064F\u064A\u064F\u0648\u0628\u0650" }, { id: 49, text: "\u0642\u064F\u0644\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0628\u06E1\u062F\u0650\u0626\u064F \u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u064F \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0639\u0650\u064A\u062F\u064F" }, { id: 50, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646 \u0636\u064E\u0644\u064E\u0644\u06E1\u062A\u064F \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0636\u0650\u0644\u0651\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064E\u0641\u06E1\u0633\u0650\u064A\u06D6 \u0648\u064E\u0625\u0650\u0646\u0650 \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u064A\u06E1\u062A\u064F \u0641\u064E\u0628\u0650\u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0631\u064E\u0628\u0651\u0650\u064A\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0633\u064E\u0645\u0650\u064A\u0639\u065E \u0642\u064E\u0631\u0650\u064A\u0628\u065E" }, { id: 51, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u062A\u064E\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u06E1 \u0641\u064E\u0632\u0650\u0639\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0627 \u0641\u064E\u0648\u06E1\u062A\u064E \u0648\u064E\u0623\u064F\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u0656 \u0642\u064E\u0631\u0650\u064A\u0628\u0656" }, { id: 52, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u062A\u0651\u064E\u0646\u064E\u0627\u0648\u064F\u0634\u064F \u0645\u0650\u0646 \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u0650\u06ED \u0628\u064E\u0639\u0650\u064A\u062F\u0656" }, { id: 53, text: "\u0648\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0648\u064E\u064A\u064E\u0642\u06E1\u0630\u0650\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0645\u0650\u0646 \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u0650\u06ED \u0628\u064E\u0639\u0650\u064A\u062F\u0656" }, { id: 54, text: "\u0648\u064E\u062D\u0650\u064A\u0644\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E \u0645\u064E\u0627 \u064A\u064E\u0634\u06E1\u062A\u064E\u0647\u064F\u0648\u0646\u064E \u0643\u064E\u0645\u064E\u0627 \u0641\u064F\u0639\u0650\u0644\u064E \u0628\u0650\u0623\u064E\u0634\u06E1\u064A\u064E\u0627\u0639\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u064F\u0631\u0650\u064A\u0628\u0650\u06ED" }] }, { id: 35, name: "\u0641\u0627\u0637\u0631", transliteration: "Fatir", type: "meccan", total_verses: 45, verses: [{ id: 1, text: "\u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0627\u0637\u0650\u0631\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062C\u064E\u0627\u0639\u0650\u0644\u0650 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0631\u064F\u0633\u064F\u0644\u064B\u0627 \u0623\u064F\u0648\u0652\u0644\u0650\u064A\u0653 \u0623\u064E\u062C\u06E1\u0646\u0650\u062D\u064E\u0629\u0656 \u0645\u0651\u064E\u062B\u06E1\u0646\u064E\u0649\u0670 \u0648\u064E\u062B\u064F\u0644\u064E\u0670\u062B\u064E \u0648\u064E\u0631\u064F\u0628\u064E\u0670\u0639\u064E\u06DA \u064A\u064E\u0632\u0650\u064A\u062F\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u0650 \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 2, text: "\u0645\u0651\u064E\u0627 \u064A\u064E\u0641\u06E1\u062A\u064E\u062D\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0645\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u0656 \u0641\u064E\u0644\u064E\u0627 \u0645\u064F\u0645\u06E1\u0633\u0650\u0643\u064E \u0644\u064E\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0645\u06E1\u0633\u0650\u0643\u06E1 \u0641\u064E\u0644\u064E\u0627 \u0645\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 3, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06DA \u0647\u064E\u0644\u06E1 \u0645\u0650\u0646\u06E1 \u062E\u064E\u0670\u0644\u0650\u0642\u064D \u063A\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u062A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0643\u064E \u0641\u064E\u0642\u064E\u062F\u06E1 \u0643\u064F\u0630\u0651\u0650\u0628\u064E\u062A\u06E1 \u0631\u064F\u0633\u064F\u0644\u065E \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E\u06DA \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u064F" }, { id: 5, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0625\u0650\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u065E\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u063A\u064F\u0631\u0651\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u063A\u064F\u0631\u0651\u064E\u0646\u0651\u064E\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u063A\u064E\u0631\u064F\u0648\u0631\u064F" }, { id: 6, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0641\u064E\u0671\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0647\u064F \u0639\u064E\u062F\u064F\u0648\u0651\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u062D\u0650\u0632\u06E1\u0628\u064E\u0647\u064F\u06E5 \u0644\u0650\u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u0633\u0651\u064E\u0639\u0650\u064A\u0631\u0650" }, { id: 7, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u065E\u06D6 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0623\u064E\u062C\u06E1\u0631\u065E \u0643\u064E\u0628\u0650\u064A\u0631\u064C" }, { id: 8, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u0632\u064F\u064A\u0651\u0650\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0633\u064F\u0648\u0653\u0621\u064F \u0639\u064E\u0645\u064E\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u0631\u064E\u0621\u064E\u0627\u0647\u064F \u062D\u064E\u0633\u064E\u0646\u0657\u0627\u06D6 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0636\u0650\u0644\u0651\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0630\u06E1\u0647\u064E\u0628\u06E1 \u0646\u064E\u0641\u06E1\u0633\u064F\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062D\u064E\u0633\u064E\u0631\u064E\u0670\u062A\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0635\u06E1\u0646\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u064E \u0671\u0644\u0631\u0651\u0650\u064A\u064E\u0670\u062D\u064E \u0641\u064E\u062A\u064F\u062B\u0650\u064A\u0631\u064F \u0633\u064E\u062D\u064E\u0627\u0628\u0657\u0627 \u0641\u064E\u0633\u064F\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0644\u064E\u062F\u0656 \u0645\u0651\u064E\u064A\u0651\u0650\u062A\u0656 \u0641\u064E\u0623\u064E\u062D\u06E1\u064A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u0646\u0651\u064F\u0634\u064F\u0648\u0631\u064F" }, { id: 10, text: "\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0632\u0651\u064E\u0629\u064E \u0641\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0639\u0650\u0632\u0651\u064E\u0629\u064F \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627\u06DA \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064E\u0635\u06E1\u0639\u064E\u062F\u064F \u0671\u0644\u06E1\u0643\u064E\u0644\u0650\u0645\u064F \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064F \u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0645\u064E\u0644\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064F \u064A\u064E\u0631\u06E1\u0641\u064E\u0639\u064F\u0647\u064F\u06E5\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0645\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u065E\u06D6 \u0648\u064E\u0645\u064E\u0643\u06E1\u0631\u064F \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u064A\u064E\u0628\u064F\u0648\u0631\u064F" }, { id: 11, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062A\u064F\u0631\u064E\u0627\u0628\u0656 \u062B\u064F\u0645\u0651\u064E \u0645\u0650\u0646 \u0646\u0651\u064F\u0637\u06E1\u0641\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0639\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F \u0645\u0650\u0646\u06E1 \u0623\u064F\u0646\u062B\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0636\u064E\u0639\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0639\u0650\u0644\u06E1\u0645\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0639\u064E\u0645\u0651\u064E\u0631\u064F \u0645\u0650\u0646 \u0645\u0651\u064F\u0639\u064E\u0645\u0651\u064E\u0631\u0656 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0646\u0642\u064E\u0635\u064F \u0645\u0650\u0646\u06E1 \u0639\u064F\u0645\u064F\u0631\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u064D\u06DA \u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0633\u0650\u064A\u0631\u065E" }, { id: 12, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E\u0627\u0646\u0650 \u0647\u064E\u0670\u0630\u064E\u0627 \u0639\u064E\u0630\u06E1\u0628\u065E \u0641\u064F\u0631\u064E\u0627\u062A\u065E \u0633\u064E\u0627\u0653\u0626\u0650\u063A\u065E \u0634\u064E\u0631\u064E\u0627\u0628\u064F\u0647\u064F\u06E5 \u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u0650\u0644\u06E1\u062D\u064C \u0623\u064F\u062C\u064E\u0627\u062C\u065E\u06D6 \u0648\u064E\u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0656 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0644\u064E\u062D\u06E1\u0645\u0657\u0627 \u0637\u064E\u0631\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u062A\u064E\u0633\u06E1\u062A\u064E\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0646\u064E \u062D\u0650\u0644\u06E1\u064A\u064E\u0629\u0657 \u062A\u064E\u0644\u06E1\u0628\u064E\u0633\u064F\u0648\u0646\u064E\u0647\u064E\u0627\u06D6 \u0648\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064E \u0641\u0650\u064A\u0647\u0650 \u0645\u064E\u0648\u064E\u0627\u062E\u0650\u0631\u064E \u0644\u0650\u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u064A\u064F\u0648\u0644\u0650\u062C\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u064A\u064F\u0648\u0644\u0650\u062C\u064F \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E\u06D6 \u0643\u064F\u0644\u0651\u065E \u064A\u064E\u062C\u06E1\u0631\u0650\u064A \u0644\u0650\u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064F\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0642\u0650\u0637\u06E1\u0645\u0650\u064A\u0631\u064D" }, { id: 14, text: "\u0625\u0650\u0646 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0627\u0652 \u062F\u064F\u0639\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0633\u064E\u0645\u0650\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0634\u0650\u0631\u06E1\u0643\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064E \u0645\u0650\u062B\u06E1\u0644\u064F \u062E\u064E\u0628\u0650\u064A\u0631\u0656" }, { id: 15, text: "\u06DE\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0623\u064E\u0646\u062A\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064F\u0642\u064E\u0631\u064E\u0627\u0653\u0621\u064F \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0646\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u062F\u064F" }, { id: 16, text: "\u0625\u0650\u0646 \u064A\u064E\u0634\u064E\u0623\u06E1 \u064A\u064F\u0630\u06E1\u0647\u0650\u0628\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0623\u06E1\u062A\u0650 \u0628\u0650\u062E\u064E\u0644\u06E1\u0642\u0656 \u062C\u064E\u062F\u0650\u064A\u062F\u0656" }, { id: 17, text: "\u0648\u064E\u0645\u064E\u0627 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0639\u064E\u0632\u0650\u064A\u0632\u0656" }, { id: 18, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0632\u0650\u0631\u064F \u0648\u064E\u0627\u0632\u0650\u0631\u064E\u0629\u065E \u0648\u0650\u0632\u06E1\u0631\u064E \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u062F\u06E1\u0639\u064F \u0645\u064F\u062B\u06E1\u0642\u064E\u0644\u064E\u0629\u064C \u0625\u0650\u0644\u064E\u0649\u0670 \u062D\u0650\u0645\u06E1\u0644\u0650\u0647\u064E\u0627 \u0644\u064E\u0627 \u064A\u064F\u062D\u06E1\u0645\u064E\u0644\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064F \u0634\u064E\u064A\u06E1\u0621\u065E \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0627 \u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670\u0653\u06D7 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062A\u064F\u0646\u0630\u0650\u0631\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E\u06DA \u0648\u064E\u0645\u064E\u0646 \u062A\u064E\u0632\u064E\u0643\u0651\u064E\u0649\u0670 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u062A\u064E\u0632\u064E\u0643\u0651\u064E\u0649\u0670 \u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 19, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 20, text: "\u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u064F \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u0646\u0651\u064F\u0648\u0631\u064F" }, { id: 21, text: "\u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u0638\u0651\u0650\u0644\u0651\u064F \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u0631\u064F\u0648\u0631\u064F" }, { id: 22, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u064A\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u062A\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0633\u06E1\u0645\u0650\u0639\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0628\u0650\u0645\u064F\u0633\u06E1\u0645\u0650\u0639\u0656 \u0645\u0651\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0628\u064F\u0648\u0631\u0650" }, { id: 23, text: "\u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u062A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u0630\u0650\u064A\u0631\u064C" }, { id: 24, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0628\u064E\u0634\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0646\u064E\u0630\u0650\u064A\u0631\u0657\u0627\u06DA \u0648\u064E\u0625\u0650\u0646 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0646\u064E\u0630\u0650\u064A\u0631\u065E" }, { id: 25, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0643\u064E \u0641\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0628\u0650\u0671\u0644\u0632\u0651\u064F\u0628\u064F\u0631\u0650 \u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0650\u064A\u0631\u0650" }, { id: 26, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062E\u064E\u0630\u06E1\u062A\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652\u06D6 \u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0646\u064E\u0643\u0650\u064A\u0631\u0650" }, { id: 27, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u062B\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0656 \u0645\u0651\u064F\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064B\u0627 \u0623\u064E\u0644\u06E1\u0648\u064E\u0670\u0646\u064F\u0647\u064E\u0627\u06DA \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u0650 \u062C\u064F\u062F\u064E\u062F\u064F\u06E2 \u0628\u0650\u064A\u0636\u065E \u0648\u064E\u062D\u064F\u0645\u06E1\u0631\u065E \u0645\u0651\u064F\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064C \u0623\u064E\u0644\u06E1\u0648\u064E\u0670\u0646\u064F\u0647\u064E\u0627 \u0648\u064E\u063A\u064E\u0631\u064E\u0627\u0628\u0650\u064A\u0628\u064F \u0633\u064F\u0648\u062F\u065E" }, { id: 28, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0671\u0644\u062F\u0651\u064E\u0648\u064E\u0627\u0653\u0628\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0645\u064F\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064C \u0623\u064E\u0644\u06E1\u0648\u064E\u0670\u0646\u064F\u0647\u064F\u06E5 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D7 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u062E\u06E1\u0634\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650 \u0671\u0644\u06E1\u0639\u064F\u0644\u064E\u0645\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u064C \u063A\u064E\u0641\u064F\u0648\u0631\u064C" }, { id: 29, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0646\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0633\u0650\u0631\u0651\u0657\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u0657 \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u062A\u0650\u062C\u064E\u0670\u0631\u064E\u0629\u0657 \u0644\u0651\u064E\u0646 \u062A\u064E\u0628\u064F\u0648\u0631\u064E" }, { id: 30, text: "\u0644\u0650\u064A\u064F\u0648\u064E\u0641\u0651\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0632\u0650\u064A\u062F\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0634\u064E\u0643\u064F\u0648\u0631\u065E" }, { id: 31, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u0644\u064E\u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 32, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0648\u06E1\u0631\u064E\u062B\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0635\u06E1\u0637\u064E\u0641\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627\u06D6 \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0638\u064E\u0627\u0644\u0650\u0645\u065E \u0644\u0651\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064F\u0642\u06E1\u062A\u064E\u0635\u0650\u062F\u065E \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u0627\u0628\u0650\u0642\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064E\u0670\u062A\u0650 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u06E1\u0643\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 33, text: "\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u064F \u0639\u064E\u062F\u06E1\u0646\u0656 \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u064A\u064F\u062D\u064E\u0644\u0651\u064E\u0648\u06E1\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0633\u064E\u0627\u0648\u0650\u0631\u064E \u0645\u0650\u0646 \u0630\u064E\u0647\u064E\u0628\u0656 \u0648\u064E\u0644\u064F\u0624\u06E1\u0644\u064F\u0624\u0657\u0627\u06D6 \u0648\u064E\u0644\u0650\u0628\u064E\u0627\u0633\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062D\u064E\u0631\u0650\u064A\u0631\u065E" }, { id: 34, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0630\u06E1\u0647\u064E\u0628\u064E \u0639\u064E\u0646\u0651\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u0632\u064E\u0646\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u064E\u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0634\u064E\u0643\u064F\u0648\u0631\u064C" }, { id: 35, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u062D\u064E\u0644\u0651\u064E\u0646\u064E\u0627 \u062F\u064E\u0627\u0631\u064E \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0627\u0645\u064E\u0629\u0650 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0644\u064E\u0627 \u064A\u064E\u0645\u064E\u0633\u0651\u064F\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0646\u064E\u0635\u064E\u0628\u065E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0645\u064E\u0633\u0651\u064F\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064F\u063A\u064F\u0648\u0628\u065E" }, { id: 36, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0627\u0631\u064F \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0644\u064E\u0627 \u064A\u064F\u0642\u06E1\u0636\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0641\u064E\u064A\u064E\u0645\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u062E\u064E\u0641\u0651\u064E\u0641\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0650\u0647\u064E\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0643\u064F\u0644\u0651\u064E \u0643\u064E\u0641\u064F\u0648\u0631\u0656" }, { id: 37, text: "\u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0635\u06E1\u0637\u064E\u0631\u0650\u062E\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0631\u0650\u062C\u06E1\u0646\u064E\u0627 \u0646\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0635\u064E\u0670\u0644\u0650\u062D\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u06DA \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u0646\u064F\u0639\u064E\u0645\u0651\u0650\u0631\u06E1\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F \u0641\u0650\u064A\u0647\u0650 \u0645\u064E\u0646 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064E \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0630\u0650\u064A\u0631\u064F\u06D6 \u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0641\u064E\u0645\u064E\u0627 \u0644\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0646\u0651\u064E\u0635\u0650\u064A\u0631\u064D" }, { id: 38, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0670\u0644\u0650\u0645\u064F \u063A\u064E\u064A\u06E1\u0628\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 39, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u062E\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0641\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0641\u064E\u0645\u064E\u0646 \u0643\u064E\u0641\u064E\u0631\u064E \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0643\u064F\u0641\u06E1\u0631\u064F\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0632\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0643\u064F\u0641\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0642\u06E1\u062A\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0632\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0643\u064F\u0641\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u062E\u064E\u0633\u064E\u0627\u0631\u0657\u0627" }, { id: 40, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0631\u064F\u0648\u0646\u0650\u064A \u0645\u064E\u0627\u0630\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0634\u0650\u0631\u06E1\u0643\u065E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0623\u064E\u0645\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u062A\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u06DA \u0628\u064E\u0644\u06E1 \u0625\u0650\u0646 \u064A\u064E\u0639\u0650\u062F\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u063A\u064F\u0631\u064F\u0648\u0631\u064B\u0627" }, { id: 41, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0645\u06E1\u0633\u0650\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0623\u064E\u0646 \u062A\u064E\u0632\u064F\u0648\u0644\u064E\u0627\u06DA \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0632\u064E\u0627\u0644\u064E\u062A\u064E\u0627\u0653 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0633\u064E\u0643\u064E\u0647\u064F\u0645\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u062D\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 42, text: "\u0648\u064E\u0623\u064E\u0642\u06E1\u0633\u064E\u0645\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062C\u064E\u0647\u06E1\u062F\u064E \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0626\u0650\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0644\u0651\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0646\u0651\u064E \u0623\u064E\u0647\u06E1\u062F\u064E\u0649\u0670 \u0645\u0650\u0646\u06E1 \u0625\u0650\u062D\u06E1\u062F\u064E\u0649 \u0671\u0644\u06E1\u0623\u064F\u0645\u064E\u0645\u0650\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064E\u0627 \u0632\u064E\u0627\u062F\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064F\u0641\u064F\u0648\u0631\u064B\u0627" }, { id: 43, text: "\u0671\u0633\u06E1\u062A\u0650\u0643\u06E1\u0628\u064E\u0627\u0631\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0643\u06E1\u0631\u064E \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u064A\u0655\u0650\u06DA \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u0650\u064A\u0642\u064F \u0671\u0644\u06E1\u0645\u064E\u0643\u06E1\u0631\u064F \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6\u06DA \u0641\u064E\u0647\u064E\u0644\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u064F\u0646\u0651\u064E\u062A\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E\u06DA \u0641\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0644\u0650\u0633\u064F\u0646\u0651\u064E\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0628\u06E1\u062F\u0650\u064A\u0644\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0644\u0650\u0633\u064F\u0646\u0651\u064E\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u062D\u06E1\u0648\u0650\u064A\u0644\u064B\u0627" }, { id: 44, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0634\u064E\u062F\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0642\u064F\u0648\u0651\u064E\u0629\u0657\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u064A\u064F\u0639\u06E1\u062C\u0650\u0632\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u0657\u0627 \u0642\u064E\u062F\u0650\u064A\u0631\u0657\u0627" }, { id: 45, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u064A\u064F\u0624\u064E\u0627\u062E\u0650\u0630\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u062A\u064E\u0631\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0638\u064E\u0647\u06E1\u0631\u0650\u0647\u064E\u0627 \u0645\u0650\u0646 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u064A\u064F\u0624\u064E\u062E\u0651\u0650\u0631\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u062C\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u0628\u064E\u0635\u0650\u064A\u0631\u064E\u06E2\u0627" }] }, { id: 36, name: "\u064A\u0633", transliteration: "Ya-Sin", type: "meccan", total_verses: 83, verses: [{ id: 1, text: "\u064A\u0633\u0653" }, { id: 2, text: "\u0648\u064E\u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u0650" }, { id: 3, text: "\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 4, text: "\u0639\u064E\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 5, text: "\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 6, text: "\u0644\u0650\u062A\u064F\u0646\u0630\u0650\u0631\u064E \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0645\u0651\u064E\u0627\u0653 \u0623\u064F\u0646\u0630\u0650\u0631\u064E \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u063A\u064E\u0670\u0641\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u062D\u064E\u0642\u0651\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0646\u064E\u0670\u0642\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u063A\u06E1\u0644\u064E\u0670\u0644\u0657\u0627 \u0641\u064E\u0647\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0630\u06E1\u0642\u064E\u0627\u0646\u0650 \u0641\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0642\u06E1\u0645\u064E\u062D\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0633\u064E\u062F\u0651\u0657\u0627 \u0648\u064E\u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u0650\u0647\u0650\u0645\u06E1 \u0633\u064E\u062F\u0651\u0657\u0627 \u0641\u064E\u0623\u064E\u063A\u06E1\u0634\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0623\u064E\u0646\u0630\u064E\u0631\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1 \u0644\u064E\u0645\u06E1 \u062A\u064F\u0646\u0630\u0650\u0631\u06E1\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062A\u064F\u0646\u0630\u0650\u0631\u064F \u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E \u0648\u064E\u062E\u064E\u0634\u0650\u064A\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650\u06D6 \u0641\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u06E1\u0647\u064F \u0628\u0650\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0656 \u0648\u064E\u0623\u064E\u062C\u06E1\u0631\u0656 \u0643\u064E\u0631\u0650\u064A\u0645\u064D" }, { id: 12, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0646\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u0648\u064E\u0646\u064E\u0643\u06E1\u062A\u064F\u0628\u064F \u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064F\u0648\u0627\u0652 \u0648\u064E\u0621\u064E\u0627\u062B\u064E\u0670\u0631\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D \u0623\u064E\u062D\u06E1\u0635\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0641\u0650\u064A\u0653 \u0625\u0650\u0645\u064E\u0627\u0645\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 13, text: "\u0648\u064E\u0671\u0636\u06E1\u0631\u0650\u0628\u06E1 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u062B\u064E\u0644\u064B\u0627 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0650 \u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0625\u0650\u0630\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u062B\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F\u0645\u064E\u0627 \u0641\u064E\u0639\u064E\u0632\u0651\u064E\u0632\u06E1\u0646\u064E\u0627 \u0628\u0650\u062B\u064E\u0627\u0644\u0650\u062B\u0656 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u064F\u0631\u06E1\u0633\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0646\u064E\u0627 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D \u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u0643\u06E1\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0644\u064E\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0648\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 18, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u062A\u064E\u0637\u064E\u064A\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0628\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0644\u064E\u0626\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0646\u062A\u064E\u0647\u064F\u0648\u0627\u0652 \u0644\u064E\u0646\u064E\u0631\u06E1\u062C\u064F\u0645\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u064A\u064E\u0645\u064E\u0633\u0651\u064E\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 19, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0637\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u064F\u0643\u064F\u0645 \u0645\u0651\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0626\u0650\u0646 \u0630\u064F\u0643\u0651\u0650\u0631\u06E1\u062A\u064F\u0645\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0645\u0651\u064F\u0633\u06E1\u0631\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0642\u06E1\u0635\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u0631\u064E\u062C\u064F\u0644\u065E \u064A\u064E\u0633\u06E1\u0639\u064E\u0649\u0670 \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0646 \u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0657\u0627 \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u0645\u064E\u0627\u0644\u0650\u064A\u064E \u0644\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u064E\u0637\u064E\u0631\u064E\u0646\u0650\u064A \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0621\u064E\u0623\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u064B \u0625\u0650\u0646 \u064A\u064F\u0631\u0650\u062F\u06E1\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0628\u0650\u0636\u064F\u0631\u0651\u0656 \u0644\u0651\u064E\u0627 \u062A\u064F\u063A\u06E1\u0646\u0650 \u0639\u064E\u0646\u0651\u0650\u064A \u0634\u064E\u0641\u064E\u0670\u0639\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0646\u0642\u0650\u0630\u064F\u0648\u0646\u0650" }, { id: 24, text: "\u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 25, text: "\u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u0650" }, { id: 26, text: "\u0642\u0650\u064A\u0644\u064E \u0671\u062F\u06E1\u062E\u064F\u0644\u0650 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E\u06D6 \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E \u0642\u064E\u0648\u06E1\u0645\u0650\u064A \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0628\u0650\u0645\u064E\u0627 \u063A\u064E\u0641\u064E\u0631\u064E \u0644\u0650\u064A \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0643\u06E1\u0631\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u06DE\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u062C\u064F\u0646\u062F\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064F\u0646\u0632\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 29, text: "\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0635\u064E\u064A\u06E1\u062D\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u062E\u064E\u0670\u0645\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u064A\u064E\u0670\u062D\u064E\u0633\u06E1\u0631\u064E\u0629\u064B \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u06DA \u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0643\u064E\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064F\u0648\u0646\u0650 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0644\u0651\u065E \u0644\u0651\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0645\u0650\u064A\u0639\u065E \u0644\u0651\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u062D\u06E1\u0636\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0621\u064E\u0627\u064A\u064E\u0629\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u062A\u064E\u0629\u064F \u0623\u064E\u062D\u06E1\u064A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062D\u064E\u0628\u0651\u0657\u0627 \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u062E\u0650\u064A\u0644\u0656 \u0648\u064E\u0623\u064E\u0639\u06E1\u0646\u064E\u0670\u0628\u0656 \u0648\u064E\u0641\u064E\u062C\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064F\u064A\u064F\u0648\u0646\u0650" }, { id: 35, text: "\u0644\u0650\u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062B\u064E\u0645\u064E\u0631\u0650\u0647\u0650\u06E6 \u0648\u064E\u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064E\u062A\u06E1\u0647\u064F \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064E \u0643\u064F\u0644\u0651\u064E\u0647\u064E\u0627 \u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064F\u0646\u06E2\u0628\u0650\u062A\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0648\u064E\u0645\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0648\u064E\u0621\u064E\u0627\u064A\u064E\u0629\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064F \u0646\u064E\u0633\u06E1\u0644\u064E\u062E\u064F \u0645\u0650\u0646\u06E1\u0647\u064F \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u064F\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064F \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0644\u0650\u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u0656 \u0644\u0651\u064E\u0647\u064E\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062A\u064E\u0642\u06E1\u062F\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u0650" }, { id: 39, text: "\u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E \u0642\u064E\u062F\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u064E\u0646\u064E\u0627\u0632\u0650\u0644\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0639\u064E\u0627\u062F\u064E \u0643\u064E\u0671\u0644\u06E1\u0639\u064F\u0631\u06E1\u062C\u064F\u0648\u0646\u0650 \u0671\u0644\u06E1\u0642\u064E\u062F\u0650\u064A\u0645\u0650" }, { id: 40, text: "\u0644\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064F \u064A\u064E\u0646\u06E2\u0628\u064E\u063A\u0650\u064A \u0644\u064E\u0647\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064F\u062F\u06E1\u0631\u0650\u0643\u064E \u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064F \u0633\u064E\u0627\u0628\u0650\u0642\u064F \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u065E \u0641\u0650\u064A \u0641\u064E\u0644\u064E\u0643\u0656 \u064A\u064E\u0633\u06E1\u0628\u064E\u062D\u064F\u0648\u0646\u064E" }, { id: 41, text: "\u0648\u064E\u0621\u064E\u0627\u064A\u064E\u0629\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0627 \u062D\u064E\u0645\u064E\u0644\u06E1\u0646\u064E\u0627 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u062D\u064F\u0648\u0646\u0650" }, { id: 42, text: "\u0648\u064E\u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u064A\u064E\u0631\u06E1\u0643\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0648\u064E\u0625\u0650\u0646 \u0646\u0651\u064E\u0634\u064E\u0623\u06E1 \u0646\u064F\u063A\u06E1\u0631\u0650\u0642\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u0635\u064E\u0631\u0650\u064A\u062E\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0642\u064E\u0630\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u0645\u064E\u062A\u064E\u0670\u0639\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 45, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u06E1\u0641\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0631\u06E1\u062D\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0645\u064F\u0639\u06E1\u0631\u0650\u0636\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u064F\u0637\u06E1\u0639\u0650\u0645\u064F \u0645\u064E\u0646 \u0644\u0651\u064E\u0648\u06E1 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0637\u06E1\u0639\u064E\u0645\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 48, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u062A\u064E\u0649\u0670 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0648\u064E\u0639\u06E1\u062F\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 49, text: "\u0645\u064E\u0627 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0635\u064E\u064A\u06E1\u062D\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u062A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062E\u0650\u0635\u0651\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u062A\u064E\u0648\u06E1\u0635\u0650\u064A\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0648\u064E\u0646\u064F\u0641\u0650\u062E\u064E \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u0648\u0631\u0650 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062C\u06E1\u062F\u064E\u0627\u062B\u0650 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0646\u0633\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0648\u064E\u064A\u06E1\u0644\u064E\u0646\u064E\u0627 \u0645\u064E\u0646\u06E2 \u0628\u064E\u0639\u064E\u062B\u064E\u0646\u064E\u0627 \u0645\u0650\u0646 \u0645\u0651\u064E\u0631\u06E1\u0642\u064E\u062F\u0650\u0646\u064E\u0627\u06DC\u06D7 \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u064E\u0627 \u0648\u064E\u0639\u064E\u062F\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0648\u064E\u0635\u064E\u062F\u064E\u0642\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0635\u064E\u064A\u06E1\u062D\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u065E \u0644\u0651\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u062D\u06E1\u0636\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u0641\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u062A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F \u0646\u064E\u0641\u06E1\u0633\u065E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0641\u0650\u064A \u0634\u064F\u063A\u064F\u0644\u0656 \u0641\u064E\u0670\u0643\u0650\u0647\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0638\u0650\u0644\u064E\u0670\u0644\u064D \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0643\u0650 \u0645\u064F\u062A\u0651\u064E\u0643\u0650\u0640\u0654\u064F\u0648\u0646\u064E" }, { id: 57, text: "\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u062F\u0651\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0633\u064E\u0644\u064E\u0670\u0645\u065E \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0656 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0656" }, { id: 59, text: "\u0648\u064E\u0671\u0645\u06E1\u062A\u064E\u0670\u0632\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u06DE\u0623\u064E\u0644\u064E\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0647\u064E\u062F\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0621\u064E\u0627\u062F\u064E\u0645\u064E \u0623\u064E\u0646 \u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 61, text: "\u0648\u064E\u0623\u064E\u0646\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u0650\u064A\u06DA \u0647\u064E\u0670\u0630\u064E\u0627 \u0635\u0650\u0631\u064E\u0670\u0637\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u065E" }, { id: 62, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u062C\u0650\u0628\u0650\u0644\u0651\u0657\u0627 \u0643\u064E\u062B\u0650\u064A\u0631\u064B\u0627\u06D6 \u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0671\u0635\u06E1\u0644\u064E\u0648\u06E1\u0647\u064E\u0627 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u062E\u06E1\u062A\u0650\u0645\u064F \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u062A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064F\u0646\u064E\u0627\u0653 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u062A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F \u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0644\u064E\u0637\u064E\u0645\u064E\u0633\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0628\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u0650\u0631\u064E\u0670\u0637\u064E \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0644\u064E\u0645\u064E\u0633\u064E\u062E\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0670\u0639\u064F\u0648\u0627\u0652 \u0645\u064F\u0636\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0648\u064E\u0645\u064E\u0646 \u0646\u0651\u064F\u0639\u064E\u0645\u0651\u0650\u0631\u06E1\u0647\u064F \u0646\u064F\u0646\u064E\u0643\u0651\u0650\u0633\u06E1\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u0650\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u0648\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u0651\u064E\u0645\u06E1\u0646\u064E\u0670\u0647\u064F \u0671\u0644\u0634\u0651\u0650\u0639\u06E1\u0631\u064E \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0646\u06E2\u0628\u064E\u063A\u0650\u064A \u0644\u064E\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u065E \u0648\u064E\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 70, text: "\u0644\u0651\u0650\u064A\u064F\u0646\u0630\u0650\u0631\u064E \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u062D\u064E\u064A\u0651\u0657\u0627 \u0648\u064E\u064A\u064E\u062D\u0650\u0642\u0651\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 71, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0646\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0657\u0627 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064E\u0627 \u0645\u064E\u0670\u0644\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0648\u064E\u0630\u064E\u0644\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0631\u064E\u0643\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0646\u064E\u0670\u0641\u0650\u0639\u064F \u0648\u064E\u0645\u064E\u0634\u064E\u0627\u0631\u0650\u0628\u064F\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 74, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u0657 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 75, text: "\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E \u0646\u064E\u0635\u06E1\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064F\u0646\u062F\u065E \u0645\u0651\u064F\u062D\u06E1\u0636\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u0632\u064F\u0646\u0643\u064E \u0642\u064E\u0648\u06E1\u0644\u064F\u0647\u064F\u0645\u06E1\u06D8 \u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u064A\u064F\u0633\u0650\u0631\u0651\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0639\u06E1\u0644\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 77, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0623\u064E\u0646\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u0650\u0646 \u0646\u0651\u064F\u0637\u06E1\u0641\u064E\u0629\u0656 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0648\u064E \u062E\u064E\u0635\u0650\u064A\u0645\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 78, text: "\u0648\u064E\u0636\u064E\u0631\u064E\u0628\u064E \u0644\u064E\u0646\u064E\u0627 \u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0648\u064E\u0646\u064E\u0633\u0650\u064A\u064E \u062E\u064E\u0644\u06E1\u0642\u064E\u0647\u064F\u06E5\u06D6 \u0642\u064E\u0627\u0644\u064E \u0645\u064E\u0646 \u064A\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0639\u0650\u0638\u064E\u0670\u0645\u064E \u0648\u064E\u0647\u0650\u064A\u064E \u0631\u064E\u0645\u0650\u064A\u0645\u065E" }, { id: 79, text: "\u0642\u064F\u0644\u06E1 \u064A\u064F\u062D\u06E1\u064A\u0650\u064A\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0634\u064E\u0623\u064E\u0647\u064E\u0627\u0653 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u0656\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u062E\u064E\u0644\u06E1\u0642\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 80, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u0650 \u0671\u0644\u06E1\u0623\u064E\u062E\u06E1\u0636\u064E\u0631\u0650 \u0646\u064E\u0627\u0631\u0657\u0627 \u0641\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u062A\u064F\u0648\u0642\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u0650\u0642\u064E\u0670\u062F\u0650\u0631\u064D \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064E \u0645\u0650\u062B\u06E1\u0644\u064E\u0647\u064F\u0645\u06DA \u0628\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062E\u064E\u0644\u0651\u064E\u0640\u0670\u0642\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 82, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0631\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627 \u0623\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064E \u0644\u064E\u0647\u064F\u06E5 \u0643\u064F\u0646 \u0641\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F" }, { id: 83, text: "\u0641\u064E\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u0650\u064A\u064E\u062F\u0650\u0647\u0650\u06E6 \u0645\u064E\u0644\u064E\u0643\u064F\u0648\u062A\u064F \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }] }, { id: 37, name: "\u0627\u0644\u0635\u0627\u0641\u0627\u062A", transliteration: "As-Saffat", type: "meccan", total_verses: 182, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0653\u0641\u0651\u064E\u0640\u0670\u062A\u0650 \u0635\u064E\u0641\u0651\u0657\u0627" }, { id: 2, text: "\u0641\u064E\u0671\u0644\u0632\u0651\u064E\u0640\u0670\u062C\u0650\u0631\u064E\u0670\u062A\u0650 \u0632\u064E\u062C\u06E1\u0631\u0657\u0627" }, { id: 3, text: "\u0641\u064E\u0671\u0644\u062A\u0651\u064E\u0640\u0670\u0644\u0650\u064A\u064E\u0670\u062A\u0650 \u0630\u0650\u0643\u06E1\u0631\u064B\u0627" }, { id: 4, text: "\u0625\u0650\u0646\u0651\u064E \u0625\u0650\u0644\u064E\u0670\u0647\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0648\u064E\u0670\u062D\u0650\u062F\u065E" }, { id: 5, text: "\u0631\u0651\u064E\u0628\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064E\u0634\u064E\u0670\u0631\u0650\u0642\u0650" }, { id: 6, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0632\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0628\u0650\u0632\u0650\u064A\u0646\u064E\u0629\u064D \u0671\u0644\u06E1\u0643\u064E\u0648\u064E\u0627\u0643\u0650\u0628\u0650" }, { id: 7, text: "\u0648\u064E\u062D\u0650\u0641\u06E1\u0638\u0657\u0627 \u0645\u0651\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0656 \u0645\u0651\u064E\u0627\u0631\u0650\u062F\u0656" }, { id: 8, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u0651\u064E\u0645\u0651\u064E\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0625\u0650 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0649\u0670 \u0648\u064E\u064A\u064F\u0642\u06E1\u0630\u064E\u0641\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u062C\u064E\u0627\u0646\u0650\u0628\u0656" }, { id: 9, text: "\u062F\u064F\u062D\u064F\u0648\u0631\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0648\u064E\u0627\u0635\u0650\u0628\u064C" }, { id: 10, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u062E\u064E\u0637\u0650\u0641\u064E \u0671\u0644\u06E1\u062E\u064E\u0637\u06E1\u0641\u064E\u0629\u064E \u0641\u064E\u0623\u064E\u062A\u06E1\u0628\u064E\u0639\u064E\u0647\u064F\u06E5 \u0634\u0650\u0647\u064E\u0627\u0628\u065E \u062B\u064E\u0627\u0642\u0650\u0628\u065E" }, { id: 11, text: "\u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0641\u06E1\u062A\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u062E\u064E\u0644\u06E1\u0642\u064B\u0627 \u0623\u064E\u0645 \u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0637\u0650\u064A\u0646\u0656 \u0644\u0651\u064E\u0627\u0632\u0650\u0628\u0650\u06ED" }, { id: 12, text: "\u0628\u064E\u0644\u06E1 \u0639\u064E\u062C\u0650\u0628\u06E1\u062A\u064E \u0648\u064E\u064A\u064E\u0633\u06E1\u062E\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0630\u064F\u0643\u0651\u0650\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0627\u0652 \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u064A\u064E\u0633\u06E1\u062A\u064E\u0633\u06E1\u062E\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 16, text: "\u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0645\u0650\u062A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u062A\u064F\u0631\u064E\u0627\u0628\u0657\u0627 \u0648\u064E\u0639\u0650\u0638\u064E\u0670\u0645\u064B\u0627 \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064E\u0628\u06E1\u0639\u064F\u0648\u062B\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0623\u064E\u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0642\u064F\u0644\u06E1 \u0646\u064E\u0639\u064E\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062F\u064E\u0670\u062E\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0647\u0650\u064A\u064E \u0632\u064E\u062C\u06E1\u0631\u064E\u0629\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u065E \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0648\u064E\u064A\u06E1\u0644\u064E\u0646\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 21, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0635\u06E1\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u06DE\u0671\u062D\u06E1\u0634\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0671\u0647\u06E1\u062F\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0650 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 24, text: "\u0648\u064E\u0642\u0650\u0641\u064F\u0648\u0647\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0633\u06E1\u0640\u0654\u064F\u0648\u0644\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0646\u064E\u0627\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0645\u064F\u0633\u06E1\u062A\u064E\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0648\u064E\u0623\u064E\u0642\u06E1\u0628\u064E\u0644\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u064A\u064E\u062A\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E\u0646\u064E\u0627 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650" }, { id: 29, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0650\u06ED\u06D6 \u0628\u064E\u0644\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0637\u064E\u0670\u063A\u0650\u064A\u0646\u064E" }, { id: 31, text: "\u0641\u064E\u062D\u064E\u0642\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0642\u064E\u0648\u06E1\u0644\u064F \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0630\u064E\u0627\u0653\u0626\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u0641\u064E\u0623\u064E\u063A\u06E1\u0648\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u063A\u064E\u0670\u0648\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0645\u064F\u0634\u06E1\u062A\u064E\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 35, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u0626\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u062A\u064E\u0627\u0631\u0650\u0643\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u0650\u0646\u064E\u0627 \u0644\u0650\u0634\u064E\u0627\u0639\u0650\u0631\u0656 \u0645\u0651\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u0650\u06ED" }, { id: 37, text: "\u0628\u064E\u0644\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0635\u064E\u062F\u0651\u064E\u0642\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0630\u064E\u0627\u0653\u0626\u0650\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u06E1\u0623\u064E\u0644\u0650\u064A\u0645\u0650" }, { id: 39, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u0650\u0628\u064E\u0627\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0644\u064E\u0635\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0631\u0650\u0632\u06E1\u0642\u065E \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u065E" }, { id: 42, text: "\u0641\u064E\u0648\u064E\u0670\u0643\u0650\u0647\u064F \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0643\u06E1\u0631\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u0639\u0650\u064A\u0645\u0650" }, { id: 44, text: "\u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064F\u0631\u064F\u0631\u0656 \u0645\u0651\u064F\u062A\u064E\u0642\u064E\u0670\u0628\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 45, text: "\u064A\u064F\u0637\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0643\u064E\u0623\u06E1\u0633\u0656 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0639\u0650\u064A\u0646\u0650\u06ED" }, { id: 46, text: "\u0628\u064E\u064A\u06E1\u0636\u064E\u0627\u0653\u0621\u064E \u0644\u064E\u0630\u0651\u064E\u0629\u0656 \u0644\u0651\u0650\u0644\u0634\u0651\u064E\u0640\u0670\u0631\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0644\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u063A\u064E\u0648\u06E1\u0644\u065E \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u064A\u064F\u0646\u0632\u064E\u0641\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0639\u0650\u0646\u062F\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0670\u0635\u0650\u0631\u064E\u0670\u062A\u064F \u0671\u0644\u0637\u0651\u064E\u0631\u06E1\u0641\u0650 \u0639\u0650\u064A\u0646\u065E" }, { id: 49, text: "\u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0646\u0651\u064E \u0628\u064E\u064A\u06E1\u0636\u065E \u0645\u0651\u064E\u0643\u06E1\u0646\u064F\u0648\u0646\u065E" }, { id: 50, text: "\u0641\u064E\u0623\u064E\u0642\u06E1\u0628\u064E\u0644\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u064A\u064E\u062A\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0642\u064E\u0627\u0644\u064E \u0642\u064E\u0627\u0653\u0626\u0650\u0644\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u064A \u0642\u064E\u0631\u0650\u064A\u0646\u065E" }, { id: 52, text: "\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 53, text: "\u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0645\u0650\u062A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u062A\u064F\u0631\u064E\u0627\u0628\u0657\u0627 \u0648\u064E\u0639\u0650\u0638\u064E\u0670\u0645\u064B\u0627 \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064E\u062F\u0650\u064A\u0646\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u0642\u064E\u0627\u0644\u064E \u0647\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0637\u0651\u064E\u0644\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0641\u064E\u0671\u0637\u0651\u064E\u0644\u064E\u0639\u064E \u0641\u064E\u0631\u064E\u0621\u064E\u0627\u0647\u064F \u0641\u0650\u064A \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 56, text: "\u0642\u064E\u0627\u0644\u064E \u062A\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u0643\u0650\u062F\u062A\u0651\u064E \u0644\u064E\u062A\u064F\u0631\u06E1\u062F\u0650\u064A\u0646\u0650" }, { id: 57, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0646\u062A\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0636\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 58, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u0645\u064E\u064A\u0651\u0650\u062A\u0650\u064A\u0646\u064E" }, { id: 59, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0648\u06E1\u062A\u064E\u062A\u064E\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u0645\u064F\u0639\u064E\u0630\u0651\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 60, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 61, text: "\u0644\u0650\u0645\u0650\u062B\u06E1\u0644\u0650 \u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u064E\u0644\u06E1\u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0645\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0623\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0646\u0651\u064F\u0632\u064F\u0644\u064B\u0627 \u0623\u064E\u0645\u06E1 \u0634\u064E\u062C\u064E\u0631\u064E\u0629\u064F \u0671\u0644\u0632\u0651\u064E\u0642\u0651\u064F\u0648\u0645\u0650" }, { id: 63, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 64, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0634\u064E\u062C\u064E\u0631\u064E\u0629\u065E \u062A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0641\u0650\u064A\u0653 \u0623\u064E\u0635\u06E1\u0644\u0650 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 65, text: "\u0637\u064E\u0644\u06E1\u0639\u064F\u0647\u064E\u0627 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0631\u064F\u0621\u064F\u0648\u0633\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u0650" }, { id: 66, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0623\u0653\u0643\u0650\u0644\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0641\u064E\u0645\u064E\u0627\u0644\u0650\u0640\u0654\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0671\u0644\u06E1\u0628\u064F\u0637\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0644\u064E\u0634\u064E\u0648\u06E1\u0628\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u0645\u0650\u064A\u0645\u0656" }, { id: 68, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E \u0645\u064E\u0631\u06E1\u062C\u0650\u0639\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 69, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0644\u06E1\u0641\u064E\u0648\u06E1\u0627\u0652 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0636\u064E\u0627\u0653\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 70, text: "\u0641\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062B\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u0647\u06E1\u0631\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064E \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 72, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u0650\u0645 \u0645\u0651\u064F\u0646\u0630\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 73, text: "\u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u0630\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 74, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u0650\u0628\u064E\u0627\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0644\u064E\u0635\u0650\u064A\u0646\u064E" }, { id: 75, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0646\u064E\u0627\u062F\u064E\u0649\u0670\u0646\u064E\u0627 \u0646\u064F\u0648\u062D\u065E \u0641\u064E\u0644\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u06E1\u0645\u064F\u062C\u0650\u064A\u0628\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0648\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0631\u06E1\u0628\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 77, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u064E\u0647\u064F\u06E5 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u0627\u0642\u0650\u064A\u0646\u064E" }, { id: 78, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 79, text: "\u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064F\u0648\u062D\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 80, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 81, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 82, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 83, text: "\u06DE\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0645\u0650\u0646 \u0634\u0650\u064A\u0639\u064E\u062A\u0650\u0647\u0650\u06E6 \u0644\u064E\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E" }, { id: 84, text: "\u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0642\u064E\u0644\u06E1\u0628\u0656 \u0633\u064E\u0644\u0650\u064A\u0645\u064D" }, { id: 85, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0623\u064E\u0628\u0650\u064A\u0647\u0650 \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627\u0630\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 86, text: "\u0623\u064E\u0626\u0650\u0641\u06E1\u0643\u064B\u0627 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u0657 \u062F\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E" }, { id: 87, text: "\u0641\u064E\u0645\u064E\u0627 \u0638\u064E\u0646\u0651\u064F\u0643\u064F\u0645 \u0628\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 88, text: "\u0641\u064E\u0646\u064E\u0638\u064E\u0631\u064E \u0646\u064E\u0638\u06E1\u0631\u064E\u0629\u0657 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064F\u062C\u064F\u0648\u0645\u0650" }, { id: 89, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0633\u064E\u0642\u0650\u064A\u0645\u065E" }, { id: 90, text: "\u0641\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F \u0645\u064F\u062F\u06E1\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 91, text: "\u0641\u064E\u0631\u064E\u0627\u063A\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 92, text: "\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0646\u0637\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 93, text: "\u0641\u064E\u0631\u064E\u0627\u063A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0636\u064E\u0631\u06E1\u0628\u064E\u06E2\u0627 \u0628\u0650\u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650" }, { id: 94, text: "\u0641\u064E\u0623\u064E\u0642\u06E1\u0628\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064E\u0632\u0650\u0641\u0651\u064F\u0648\u0646\u064E" }, { id: 95, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u062A\u064E\u0646\u06E1\u062D\u0650\u062A\u064F\u0648\u0646\u064E" }, { id: 96, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 97, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0628\u06E1\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0628\u064F\u0646\u06E1\u064A\u064E\u0670\u0646\u0657\u0627 \u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u064F\u0648\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 98, text: "\u0641\u064E\u0623\u064E\u0631\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0643\u064E\u064A\u06E1\u062F\u0657\u0627 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0641\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 99, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0630\u064E\u0627\u0647\u0650\u0628\u064C \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u064A \u0633\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0646\u0650" }, { id: 100, text: "\u0631\u064E\u0628\u0651\u0650 \u0647\u064E\u0628\u06E1 \u0644\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 101, text: "\u0641\u064E\u0628\u064E\u0634\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u0650\u063A\u064F\u0644\u064E\u0670\u0645\u064D \u062D\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 102, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E \u0645\u064E\u0639\u064E\u0647\u064F \u0671\u0644\u0633\u0651\u064E\u0639\u06E1\u064A\u064E \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0628\u064F\u0646\u064E\u064A\u0651\u064E \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0631\u064E\u0649\u0670 \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u0646\u064E\u0627\u0645\u0650 \u0623\u064E\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0630\u06E1\u0628\u064E\u062D\u064F\u0643\u064E \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0645\u064E\u0627\u0630\u064E\u0627 \u062A\u064E\u0631\u064E\u0649\u0670\u06DA \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u0628\u064E\u062A\u0650 \u0671\u0641\u06E1\u0639\u064E\u0644\u06E1 \u0645\u064E\u0627 \u062A\u064F\u0624\u06E1\u0645\u064E\u0631\u064F\u06D6 \u0633\u064E\u062A\u064E\u062C\u0650\u062F\u064F\u0646\u0650\u064A\u0653 \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 103, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u064E\u0627 \u0648\u064E\u062A\u064E\u0644\u0651\u064E\u0647\u064F\u06E5 \u0644\u0650\u0644\u06E1\u062C\u064E\u0628\u0650\u064A\u0646\u0650" }, { id: 104, text: "\u0648\u064E\u0646\u064E\u0670\u062F\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0623\u064E\u0646 \u064A\u064E\u0640\u0670\u0653\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064F" }, { id: 105, text: "\u0642\u064E\u062F\u06E1 \u0635\u064E\u062F\u0651\u064E\u0642\u06E1\u062A\u064E \u0671\u0644\u0631\u0651\u064F\u0621\u06E1\u064A\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 106, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 107, text: "\u0648\u064E\u0641\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u0650\u0630\u0650\u0628\u06E1\u062D\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 108, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 109, text: "\u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E" }, { id: 110, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 111, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 112, text: "\u0648\u064E\u0628\u064E\u0634\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u0650\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0646\u064E\u0628\u0650\u064A\u0651\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 113, text: "\u0648\u064E\u0628\u064E\u0670\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E\u06DA \u0648\u064E\u0645\u0650\u0646 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u0650\u0647\u0650\u0645\u064E\u0627 \u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u065E \u0648\u064E\u0638\u064E\u0627\u0644\u0650\u0645\u065E \u0644\u0651\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0645\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 114, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0645\u064E\u0646\u064E\u0646\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E" }, { id: 115, text: "\u0648\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u0645\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0631\u06E1\u0628\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 116, text: "\u0648\u064E\u0646\u064E\u0635\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0644\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 117, text: "\u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 118, text: "\u0648\u064E\u0647\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u0635\u0651\u0650\u0631\u064E\u0670\u0637\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u064E" }, { id: 119, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 120, text: "\u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0647\u064E\u0670\u0631\u064F\u0648\u0646\u064E" }, { id: 121, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 122, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 123, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0625\u0650\u0644\u06E1\u064A\u064E\u0627\u0633\u064E \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 124, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 125, text: "\u0623\u064E\u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0628\u064E\u0639\u06E1\u0644\u0657\u0627 \u0648\u064E\u062A\u064E\u0630\u064E\u0631\u064F\u0648\u0646\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0644\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 126, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0628\u0651\u064E \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 127, text: "\u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0645\u064F\u062D\u06E1\u0636\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 128, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u0650\u0628\u064E\u0627\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0644\u064E\u0635\u0650\u064A\u0646\u064E" }, { id: 129, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 130, text: "\u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u06E1 \u064A\u064E\u0627\u0633\u0650\u064A\u0646\u064E" }, { id: 131, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 132, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 133, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064F\u0648\u0637\u0657\u0627 \u0644\u0651\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 134, text: "\u0625\u0650\u0630\u06E1 \u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 135, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u062C\u064F\u0648\u0632\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u063A\u064E\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 136, text: "\u062B\u064F\u0645\u0651\u064E \u062F\u064E\u0645\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 137, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u062A\u064E\u0645\u064F\u0631\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064F\u0635\u06E1\u0628\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 138, text: "\u0648\u064E\u0628\u0650\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 139, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u064A\u064F\u0648\u0646\u064F\u0633\u064E \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 140, text: "\u0625\u0650\u0630\u06E1 \u0623\u064E\u0628\u064E\u0642\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u062D\u064F\u0648\u0646\u0650" }, { id: 141, text: "\u0641\u064E\u0633\u064E\u0627\u0647\u064E\u0645\u064E \u0641\u064E\u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062F\u06E1\u062D\u064E\u0636\u0650\u064A\u0646\u064E" }, { id: 142, text: "\u0641\u064E\u0671\u0644\u06E1\u062A\u064E\u0642\u064E\u0645\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064F\u0648\u062A\u064F \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u0644\u0650\u064A\u0645\u065E" }, { id: 143, text: "\u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 144, text: "\u0644\u064E\u0644\u064E\u0628\u0650\u062B\u064E \u0641\u0650\u064A \u0628\u064E\u0637\u06E1\u0646\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u064A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0646\u064E" }, { id: 145, text: "\u06DE\u0641\u064E\u0646\u064E\u0628\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0631\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0633\u064E\u0642\u0650\u064A\u0645\u065E" }, { id: 146, text: "\u0648\u064E\u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0634\u064E\u062C\u064E\u0631\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u064A\u064E\u0642\u06E1\u0637\u0650\u064A\u0646\u0656" }, { id: 147, text: "\u0648\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u0650\u0627\u0652\u0626\u064E\u0629\u0650 \u0623\u064E\u0644\u06E1\u0641\u064D \u0623\u064E\u0648\u06E1 \u064A\u064E\u0632\u0650\u064A\u062F\u064F\u0648\u0646\u064E" }, { id: 148, text: "\u0641\u064E\u0640\u0654\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0641\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 149, text: "\u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0641\u06E1\u062A\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u0628\u064E\u0646\u064E\u0627\u062A\u064F \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 150, text: "\u0623\u064E\u0645\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064E \u0625\u0650\u0646\u064E\u0670\u062B\u0657\u0627 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0634\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 151, text: "\u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0625\u0650\u0641\u06E1\u0643\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E" }, { id: 152, text: "\u0648\u064E\u0644\u064E\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 153, text: "\u0623\u064E\u0635\u06E1\u0637\u064E\u0641\u064E\u0649 \u0671\u0644\u06E1\u0628\u064E\u0646\u064E\u0627\u062A\u0650 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0628\u064E\u0646\u0650\u064A\u0646\u064E" }, { id: 154, text: "\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 155, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 156, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 157, text: "\u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0643\u0650\u062A\u064E\u0670\u0628\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 158, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064E\u0629\u0650 \u0646\u064E\u0633\u064E\u0628\u0657\u0627\u06DA \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064E\u0629\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0645\u064F\u062D\u06E1\u0636\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 159, text: "\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 160, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u0650\u0628\u064E\u0627\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0644\u064E\u0635\u0650\u064A\u0646\u064E" }, { id: 161, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 162, text: "\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0628\u0650\u0641\u064E\u0670\u062A\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 163, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0635\u064E\u0627\u0644\u0650 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 164, text: "\u0648\u064E\u0645\u064E\u0627\u0645\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0642\u064E\u0627\u0645\u065E \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u065E" }, { id: 165, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u0635\u0651\u064E\u0627\u0653\u0641\u0651\u064F\u0648\u0646\u064E" }, { id: 166, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u06E1\u0645\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 167, text: "\u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E" }, { id: 168, text: "\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0639\u0650\u0646\u062F\u064E\u0646\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 169, text: "\u0644\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0639\u0650\u0628\u064E\u0627\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0644\u064E\u0635\u0650\u064A\u0646\u064E" }, { id: 170, text: "\u0641\u064E\u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 171, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0633\u064E\u0628\u064E\u0642\u064E\u062A\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u062A\u064F\u0646\u064E\u0627 \u0644\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 172, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0646\u0635\u064F\u0648\u0631\u064F\u0648\u0646\u064E" }, { id: 173, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u062C\u064F\u0646\u062F\u064E\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 174, text: "\u0641\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 175, text: "\u0648\u064E\u0623\u064E\u0628\u06E1\u0635\u0650\u0631\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 176, text: "\u0623\u064E\u0641\u064E\u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u0650\u0646\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 177, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0646\u064E\u0632\u064E\u0644\u064E \u0628\u0650\u0633\u064E\u0627\u062D\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0633\u064E\u0627\u0653\u0621\u064E \u0635\u064E\u0628\u064E\u0627\u062D\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u0630\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 178, text: "\u0648\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 179, text: "\u0648\u064E\u0623\u064E\u0628\u06E1\u0635\u0650\u0631\u06E1 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 180, text: "\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u0650\u0632\u0651\u064E\u0629\u0650 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 181, text: "\u0648\u064E\u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 182, text: "\u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }] }, { id: 38, name: "\u0635", transliteration: "Sad", type: "meccan", total_verses: 88, verses: [{ id: 1, text: "\u0635\u0653\u06DA \u0648\u064E\u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0630\u0650\u064A \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650" }, { id: 2, text: "\u0628\u064E\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0639\u0650\u0632\u0651\u064E\u0629\u0656 \u0648\u064E\u0634\u0650\u0642\u064E\u0627\u0642\u0656" }, { id: 3, text: "\u0643\u064E\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u0646\u0656 \u0641\u064E\u0646\u064E\u0627\u062F\u064E\u0648\u0627\u0652 \u0648\u0651\u064E\u0644\u064E\u0627\u062A\u064E \u062D\u0650\u064A\u0646\u064E \u0645\u064E\u0646\u064E\u0627\u0635\u0656" }, { id: 4, text: "\u0648\u064E\u0639\u064E\u062C\u0650\u0628\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0646\u0630\u0650\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0633\u064E\u0670\u062D\u0650\u0631\u065E \u0643\u064E\u0630\u0651\u064E\u0627\u0628\u064C" }, { id: 5, text: "\u0623\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u06E1\u0623\u0653\u0644\u0650\u0647\u064E\u0629\u064E \u0625\u0650\u0644\u064E\u0670\u0647\u0657\u0627 \u0648\u064E\u0670\u062D\u0650\u062F\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0634\u064E\u064A\u06E1\u0621\u064C \u0639\u064F\u062C\u064E\u0627\u0628\u065E" }, { id: 6, text: "\u0648\u064E\u0671\u0646\u0637\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0623\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0650 \u0671\u0645\u06E1\u0634\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0634\u064E\u064A\u06E1\u0621\u065E \u064A\u064F\u0631\u064E\u0627\u062F\u064F" }, { id: 7, text: "\u0645\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u0650\u0644\u0651\u064E\u0629\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u062E\u06E1\u062A\u0650\u0644\u064E\u0670\u0642\u064C" }, { id: 8, text: "\u0623\u064E\u0621\u064F\u0646\u0632\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650\u0646\u064E\u0627\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650\u064A\u06DA \u0628\u064E\u0644 \u0644\u0651\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u0650" }, { id: 9, text: "\u0623\u064E\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u0645\u06E1 \u062E\u064E\u0632\u064E\u0627\u0653\u0626\u0650\u0646\u064F \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u0648\u064E\u0647\u0651\u064E\u0627\u0628\u0650" }, { id: 10, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u06D6 \u0641\u064E\u0644\u06E1\u064A\u064E\u0631\u06E1\u062A\u064E\u0642\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 11, text: "\u062C\u064F\u0646\u062F\u065E \u0645\u0651\u064E\u0627 \u0647\u064F\u0646\u064E\u0627\u0644\u0650\u0643\u064E \u0645\u064E\u0647\u06E1\u0632\u064F\u0648\u0645\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u0650" }, { id: 12, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064F \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0639\u064E\u0627\u062F\u065E \u0648\u064E\u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0630\u064F\u0648 \u0671\u0644\u06E1\u0623\u064E\u0648\u06E1\u062A\u064E\u0627\u062F\u0650" }, { id: 13, text: "\u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064F \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064F \u0644\u064F\u0648\u0637\u0656 \u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0644\u06E1\u0640\u0654\u064E\u064A\u06E1\u0643\u064E\u0629\u0650\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u064F" }, { id: 14, text: "\u0625\u0650\u0646 \u0643\u064F\u0644\u0651\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064E \u0641\u064E\u062D\u064E\u0642\u0651\u064E \u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 15, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0646\u0638\u064F\u0631\u064F \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0635\u064E\u064A\u06E1\u062D\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0645\u0651\u064E\u0627 \u0644\u064E\u0647\u064E\u0627 \u0645\u0650\u0646 \u0641\u064E\u0648\u064E\u0627\u0642\u0656" }, { id: 16, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0639\u064E\u062C\u0651\u0650\u0644 \u0644\u0651\u064E\u0646\u064E\u0627 \u0642\u0650\u0637\u0651\u064E\u0646\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 17, text: "\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0639\u064E\u0628\u06E1\u062F\u064E\u0646\u064E\u0627 \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0630\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u064A\u06E1\u062F\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0648\u0651\u064E\u0627\u0628\u064C" }, { id: 18, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0633\u064E\u062E\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u06E1\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0634\u0650\u064A\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0634\u06E1\u0631\u064E\u0627\u0642\u0650" }, { id: 19, text: "\u0648\u064E\u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u064E \u0645\u064E\u062D\u06E1\u0634\u064F\u0648\u0631\u064E\u0629\u0657\u06D6 \u0643\u064F\u0644\u0651\u065E \u0644\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0648\u0651\u064E\u0627\u0628\u065E" }, { id: 20, text: "\u0648\u064E\u0634\u064E\u062F\u064E\u062F\u06E1\u0646\u064E\u0627 \u0645\u064F\u0644\u06E1\u0643\u064E\u0647\u064F\u06E5 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0648\u064E\u0641\u064E\u0635\u06E1\u0644\u064E \u0671\u0644\u06E1\u062E\u0650\u0637\u064E\u0627\u0628\u0650" }, { id: 21, text: "\u06DE\u0648\u064E\u0647\u064E\u0644\u06E1 \u0623\u064E\u062A\u064E\u0649\u0670\u0643\u064E \u0646\u064E\u0628\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u06E1\u062E\u064E\u0635\u06E1\u0645\u0650 \u0625\u0650\u0630\u06E1 \u062A\u064E\u0633\u064E\u0648\u0651\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u0650\u062D\u06E1\u0631\u064E\u0627\u0628\u064E" }, { id: 22, text: "\u0625\u0650\u0630\u06E1 \u062F\u064E\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0641\u064E\u0641\u064E\u0632\u0650\u0639\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0641\u06E1\u06D6 \u062E\u064E\u0635\u06E1\u0645\u064E\u0627\u0646\u0650 \u0628\u064E\u063A\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u064F\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u0641\u064E\u0671\u062D\u06E1\u0643\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0634\u06E1\u0637\u0650\u0637\u06E1 \u0648\u064E\u0671\u0647\u06E1\u062F\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0635\u0651\u0650\u0631\u064E\u0670\u0637\u0650" }, { id: 23, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0623\u064E\u062E\u0650\u064A \u0644\u064E\u0647\u064F\u06E5 \u062A\u0650\u0633\u06E1\u0639\u065E \u0648\u064E\u062A\u0650\u0633\u06E1\u0639\u064F\u0648\u0646\u064E \u0646\u064E\u0639\u06E1\u062C\u064E\u0629\u0657 \u0648\u064E\u0644\u0650\u064A\u064E \u0646\u064E\u0639\u06E1\u062C\u064E\u0629\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u065E \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0643\u06E1\u0641\u0650\u0644\u06E1\u0646\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0639\u064E\u0632\u0651\u064E\u0646\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u0650\u0637\u064E\u0627\u0628\u0650" }, { id: 24, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0642\u064E\u062F\u06E1 \u0638\u064E\u0644\u064E\u0645\u064E\u0643\u064E \u0628\u0650\u0633\u064F\u0624\u064E\u0627\u0644\u0650 \u0646\u064E\u0639\u06E1\u062C\u064E\u062A\u0650\u0643\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0646\u0650\u0639\u064E\u0627\u062C\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064F\u0644\u064E\u0637\u064E\u0627\u0653\u0621\u0650 \u0644\u064E\u064A\u064E\u0628\u06E1\u063A\u0650\u064A \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0648\u064E\u0642\u064E\u0644\u0650\u064A\u0644\u065E \u0645\u0651\u064E\u0627 \u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0638\u064E\u0646\u0651\u064E \u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064F \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u0641\u064E\u062A\u064E\u0646\u0651\u064E\u0640\u0670\u0647\u064F \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u064E\u0631\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u062E\u064E\u0631\u0651\u064E\u06E4 \u0631\u064E\u0627\u0643\u0650\u0639\u0657\u0627\u06E4 \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u0628\u064E\u06E9" }, { id: 25, text: "\u0641\u064E\u063A\u064E\u0641\u064E\u0631\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u06E5 \u0639\u0650\u0646\u062F\u064E\u0646\u064E\u0627 \u0644\u064E\u0632\u064F\u0644\u06E1\u0641\u064E\u0649\u0670 \u0648\u064E\u062D\u064F\u0633\u06E1\u0646\u064E \u0645\u064E\u0640\u0654\u064E\u0627\u0628\u0656" }, { id: 26, text: "\u064A\u064E\u0670\u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064F \u0625\u0650\u0646\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u062E\u064E\u0644\u0650\u064A\u0641\u064E\u0629\u0657 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0671\u062D\u06E1\u0643\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u0650 \u0671\u0644\u06E1\u0647\u064E\u0648\u064E\u0649\u0670 \u0641\u064E\u064A\u064F\u0636\u0650\u0644\u0651\u064E\u0643\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0636\u0650\u0644\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0646\u064E\u0633\u064F\u0648\u0627\u0652 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 27, text: "\u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0628\u064E\u0670\u0637\u0650\u0644\u0657\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0638\u064E\u0646\u0651\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0641\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 28, text: "\u0623\u064E\u0645\u06E1 \u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0643\u064E\u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0633\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0645\u06E1 \u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0643\u064E\u0671\u0644\u06E1\u0641\u064F\u062C\u0651\u064E\u0627\u0631\u0650" }, { id: 29, text: "\u0643\u0650\u062A\u064E\u0670\u0628\u064C \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0645\u064F\u0628\u064E\u0670\u0631\u064E\u0643\u065E \u0644\u0651\u0650\u064A\u064E\u062F\u0651\u064E\u0628\u0651\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u0650\u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064E \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 30, text: "\u0648\u064E\u0648\u064E\u0647\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u0650\u062F\u064E\u0627\u0648\u064F\u06E5\u062F\u064E \u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u06DA \u0646\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u06E1\u0639\u064E\u0628\u06E1\u062F\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0648\u0651\u064E\u0627\u0628\u064C" }, { id: 31, text: "\u0625\u0650\u0630\u06E1 \u0639\u064F\u0631\u0650\u0636\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0634\u0650\u064A\u0651\u0650 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0641\u0650\u0646\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u062C\u0650\u064A\u064E\u0627\u062F\u064F" }, { id: 32, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062D\u06E1\u0628\u064E\u0628\u06E1\u062A\u064F \u062D\u064F\u0628\u0651\u064E \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650 \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u064A \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0648\u064E\u0627\u0631\u064E\u062A\u06E1 \u0628\u0650\u0671\u0644\u06E1\u062D\u0650\u062C\u064E\u0627\u0628\u0650" }, { id: 33, text: "\u0631\u064F\u062F\u0651\u064F\u0648\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u0651\u064E\u06D6 \u0641\u064E\u0637\u064E\u0641\u0650\u0642\u064E \u0645\u064E\u0633\u06E1\u062D\u064E\u06E2\u0627 \u0628\u0650\u0671\u0644\u0633\u0651\u064F\u0648\u0642\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0646\u064E\u0627\u0642\u0650" }, { id: 34, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0641\u064E\u062A\u064E\u0646\u0651\u064E\u0627 \u0633\u064F\u0644\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E \u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u064A\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0631\u06E1\u0633\u0650\u064A\u0651\u0650\u0647\u0650\u06E6 \u062C\u064E\u0633\u064E\u062F\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0646\u064E\u0627\u0628\u064E" }, { id: 35, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u0650\u064A \u0648\u064E\u0647\u064E\u0628\u06E1 \u0644\u0650\u064A \u0645\u064F\u0644\u06E1\u0643\u0657\u0627 \u0644\u0651\u064E\u0627 \u064A\u064E\u0646\u06E2\u0628\u064E\u063A\u0650\u064A \u0644\u0650\u0623\u064E\u062D\u064E\u062F\u0656 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u064A\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u06E1\u0648\u064E\u0647\u0651\u064E\u0627\u0628\u064F" }, { id: 36, text: "\u0641\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F \u0671\u0644\u0631\u0651\u0650\u064A\u062D\u064E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0631\u064F\u062E\u064E\u0627\u0653\u0621\u064B \u062D\u064E\u064A\u06E1\u062B\u064F \u0623\u064E\u0635\u064E\u0627\u0628\u064E" }, { id: 37, text: "\u0648\u064E\u0671\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u064E \u0643\u064F\u0644\u0651\u064E \u0628\u064E\u0646\u0651\u064E\u0627\u0653\u0621\u0656 \u0648\u064E\u063A\u064E\u0648\u0651\u064E\u0627\u0635\u0656" }, { id: 38, text: "\u0648\u064E\u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E \u0645\u064F\u0642\u064E\u0631\u0651\u064E\u0646\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0635\u06E1\u0641\u064E\u0627\u062F\u0650" }, { id: 39, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0639\u064E\u0637\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0641\u064E\u0671\u0645\u06E1\u0646\u064F\u0646\u06E1 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0645\u06E1\u0633\u0650\u0643\u06E1 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u0650\u0633\u064E\u0627\u0628\u0656" }, { id: 40, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u06E5 \u0639\u0650\u0646\u062F\u064E\u0646\u064E\u0627 \u0644\u064E\u0632\u064F\u0644\u06E1\u0641\u064E\u0649\u0670 \u0648\u064E\u062D\u064F\u0633\u06E1\u0646\u064E \u0645\u064E\u0640\u0654\u064E\u0627\u0628\u0656" }, { id: 41, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0639\u064E\u0628\u06E1\u062F\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u064A\u0651\u064F\u0648\u0628\u064E \u0625\u0650\u0630\u06E1 \u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646\u0651\u0650\u064A \u0645\u064E\u0633\u0651\u064E\u0646\u0650\u064A\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0628\u0650\u0646\u064F\u0635\u06E1\u0628\u0656 \u0648\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u064D" }, { id: 42, text: "\u0671\u0631\u06E1\u0643\u064F\u0636\u06E1 \u0628\u0650\u0631\u0650\u062C\u06E1\u0644\u0650\u0643\u064E\u06D6 \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u064F\u063A\u06E1\u062A\u064E\u0633\u064E\u0644\u064F\u06E2 \u0628\u064E\u0627\u0631\u0650\u062F\u065E \u0648\u064E\u0634\u064E\u0631\u064E\u0627\u0628\u065E" }, { id: 43, text: "\u0648\u064E\u0648\u064E\u0647\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0645\u0650\u062B\u06E1\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 44, text: "\u0648\u064E\u062E\u064F\u0630\u06E1 \u0628\u0650\u064A\u064E\u062F\u0650\u0643\u064E \u0636\u0650\u063A\u06E1\u062B\u0657\u0627 \u0641\u064E\u0671\u0636\u06E1\u0631\u0650\u0628 \u0628\u0651\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0646\u064E\u062B\u06E1\u06D7 \u0625\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064F \u0635\u064E\u0627\u0628\u0650\u0631\u0657\u0627\u06DA \u0646\u0651\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u06E1\u0639\u064E\u0628\u06E1\u062F\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0648\u0651\u064E\u0627\u0628\u065E" }, { id: 45, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0639\u0650\u0628\u064E\u0670\u062F\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0625\u0650\u0633\u06E1\u062D\u064E\u0670\u0642\u064E \u0648\u064E\u064A\u064E\u0639\u06E1\u0642\u064F\u0648\u0628\u064E \u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u064A\u06E1\u062F\u0650\u064A \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650" }, { id: 46, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0644\u064E\u0635\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u062E\u064E\u0627\u0644\u0650\u0635\u064E\u0629\u0656 \u0630\u0650\u0643\u06E1\u0631\u064E\u0649 \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u0650" }, { id: 47, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E\u0646\u064E\u0627 \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0635\u06E1\u0637\u064E\u0641\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062E\u06E1\u064A\u064E\u0627\u0631\u0650" }, { id: 48, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0625\u0650\u0633\u06E1\u0645\u064E\u0670\u0639\u0650\u064A\u0644\u064E \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0633\u064E\u0639\u064E \u0648\u064E\u0630\u064E\u0627 \u0671\u0644\u06E1\u0643\u0650\u0641\u06E1\u0644\u0650\u06D6 \u0648\u064E\u0643\u064F\u0644\u0651\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062E\u06E1\u064A\u064E\u0627\u0631\u0650" }, { id: 49, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u065E\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0644\u064E\u062D\u064F\u0633\u06E1\u0646\u064E \u0645\u064E\u0640\u0654\u064E\u0627\u0628\u0656" }, { id: 50, text: "\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0639\u064E\u062F\u06E1\u0646\u0656 \u0645\u0651\u064F\u0641\u064E\u062A\u0651\u064E\u062D\u064E\u0629\u0657 \u0644\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u064F" }, { id: 51, text: "\u0645\u064F\u062A\u0651\u064E\u0643\u0650\u0640\u0654\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0628\u0650\u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u0656 \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u0656 \u0648\u064E\u0634\u064E\u0631\u064E\u0627\u0628\u0656" }, { id: 52, text: "\u06DE\u0648\u064E\u0639\u0650\u0646\u062F\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0670\u0635\u0650\u0631\u064E\u0670\u062A\u064F \u0671\u0644\u0637\u0651\u064E\u0631\u06E1\u0641\u0650 \u0623\u064E\u062A\u06E1\u0631\u064E\u0627\u0628\u064C" }, { id: 53, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u064E\u0627 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E \u0644\u0650\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 54, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0631\u0650\u0632\u06E1\u0642\u064F\u0646\u064E\u0627 \u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0646\u0651\u064E\u0641\u064E\u0627\u062F\u064D" }, { id: 55, text: "\u0647\u064E\u0670\u0630\u064E\u0627\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u0637\u0651\u064E\u0640\u0670\u063A\u0650\u064A\u0646\u064E \u0644\u064E\u0634\u064E\u0631\u0651\u064E \u0645\u064E\u0640\u0654\u064E\u0627\u0628\u0656" }, { id: 56, text: "\u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u064A\u064E\u0635\u06E1\u0644\u064E\u0648\u06E1\u0646\u064E\u0647\u064E\u0627 \u0641\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u0650\u0647\u064E\u0627\u062F\u064F" }, { id: 57, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u064E\u0644\u06E1\u064A\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0647\u064F \u062D\u064E\u0645\u0650\u064A\u0645\u065E \u0648\u064E\u063A\u064E\u0633\u0651\u064E\u0627\u0642\u065E" }, { id: 58, text: "\u0648\u064E\u0621\u064E\u0627\u062E\u064E\u0631\u064F \u0645\u0650\u0646 \u0634\u064E\u0643\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064C" }, { id: 59, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u064E\u0648\u06E1\u062C\u065E \u0645\u0651\u064F\u0642\u06E1\u062A\u064E\u062D\u0650\u0645\u065E \u0645\u0651\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u0645\u064E\u0631\u06E1\u062D\u064E\u0628\u064E\u06E2\u0627 \u0628\u0650\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0635\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 60, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u0645\u064E\u0631\u06E1\u062D\u064E\u0628\u064E\u06E2\u0627 \u0628\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u062F\u0651\u064E\u0645\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F \u0644\u064E\u0646\u064E\u0627\u06D6 \u0641\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0642\u064E\u0631\u064E\u0627\u0631\u064F" }, { id: 61, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0645\u064E\u0646 \u0642\u064E\u062F\u0651\u064E\u0645\u064E \u0644\u064E\u0646\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u064E\u0632\u0650\u062F\u06E1\u0647\u064F \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0636\u0650\u0639\u06E1\u0641\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 62, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0644\u064E\u0646\u064E\u0627 \u0644\u064E\u0627 \u0646\u064E\u0631\u064E\u0649\u0670 \u0631\u0650\u062C\u064E\u0627\u0644\u0657\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u0639\u064F\u062F\u0651\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0634\u06E1\u0631\u064E\u0627\u0631\u0650" }, { id: 63, text: "\u0623\u064E\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0633\u0650\u062E\u06E1\u0631\u0650\u064A\u0651\u064B\u0627 \u0623\u064E\u0645\u06E1 \u0632\u064E\u0627\u063A\u064E\u062A\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F" }, { id: 64, text: "\u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u062D\u064E\u0642\u0651\u065E \u062A\u064E\u062E\u064E\u0627\u0635\u064F\u0645\u064F \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 65, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0645\u064F\u0646\u0630\u0650\u0631\u065E\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0648\u064E\u0670\u062D\u0650\u062F\u064F \u0671\u0644\u06E1\u0642\u064E\u0647\u0651\u064E\u0627\u0631\u064F" }, { id: 66, text: "\u0631\u064E\u0628\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u063A\u064E\u0641\u0651\u064E\u0640\u0670\u0631\u064F" }, { id: 67, text: "\u0642\u064F\u0644\u06E1 \u0647\u064F\u0648\u064E \u0646\u064E\u0628\u064E\u0624\u064C\u0627\u0652 \u0639\u064E\u0638\u0650\u064A\u0645\u064C" }, { id: 68, text: "\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F \u0645\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u064A\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0644\u06E1\u0645\u0650\u06ED \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0625\u0650 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u06E1 \u064A\u064E\u062E\u06E1\u062A\u064E\u0635\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0625\u0650\u0646 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 71, text: "\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0644\u0650\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u062E\u064E\u0670\u0644\u0650\u0642\u064F\u06E2 \u0628\u064E\u0634\u064E\u0631\u0657\u0627 \u0645\u0651\u0650\u0646 \u0637\u0650\u064A\u0646\u0656" }, { id: 72, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u0648\u0651\u064E\u064A\u06E1\u062A\u064F\u0647\u064F\u06E5 \u0648\u064E\u0646\u064E\u0641\u064E\u062E\u06E1\u062A\u064F \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646 \u0631\u0651\u064F\u0648\u062D\u0650\u064A \u0641\u064E\u0642\u064E\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0633\u064E\u0670\u062C\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 73, text: "\u0641\u064E\u0633\u064E\u062C\u064E\u062F\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0643\u064F\u0644\u0651\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 74, text: "\u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064E \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064E \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 75, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0640\u0670\u0653\u0625\u0650\u0628\u06E1\u0644\u0650\u064A\u0633\u064F \u0645\u064E\u0627 \u0645\u064E\u0646\u064E\u0639\u064E\u0643\u064E \u0623\u064E\u0646 \u062A\u064E\u0633\u06E1\u062C\u064F\u062F\u064E \u0644\u0650\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064F \u0628\u0650\u064A\u064E\u062F\u064E\u064A\u0651\u064E\u06D6 \u0623\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u06E1\u062A\u064E \u0623\u064E\u0645\u06E1 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0627\u0644\u0650\u064A\u0646\u064E" }, { id: 76, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0646\u064E\u0627\u06E0 \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064E\u0646\u0650\u064A \u0645\u0650\u0646 \u0646\u0651\u064E\u0627\u0631\u0656 \u0648\u064E\u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0637\u0650\u064A\u0646\u0656" }, { id: 77, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0671\u062E\u06E1\u0631\u064F\u062C\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0631\u064E\u062C\u0650\u064A\u0645\u065E" }, { id: 78, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0644\u064E\u0639\u06E1\u0646\u064E\u062A\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 79, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0641\u064E\u0623\u064E\u0646\u0638\u0650\u0631\u06E1\u0646\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u064A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0646\u064E" }, { id: 80, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u0638\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 81, text: "\u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0648\u064E\u0642\u06E1\u062A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u0650" }, { id: 82, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0628\u0650\u0639\u0650\u0632\u0651\u064E\u062A\u0650\u0643\u064E \u0644\u064E\u0623\u064F\u063A\u06E1\u0648\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 83, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u0643\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u062E\u06E1\u0644\u064E\u0635\u0650\u064A\u0646\u064E" }, { id: 84, text: "\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0623\u064E\u0642\u064F\u0648\u0644\u064F" }, { id: 85, text: "\u0644\u064E\u0623\u064E\u0645\u06E1\u0644\u064E\u0623\u064E\u0646\u0651\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0645\u0650\u0646\u0643\u064E \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0646 \u062A\u064E\u0628\u0650\u0639\u064E\u0643\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 86, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0656 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0643\u064E\u0644\u0651\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 87, text: "\u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 88, text: "\u0648\u064E\u0644\u064E\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0646\u0651\u064E \u0646\u064E\u0628\u064E\u0623\u064E\u0647\u064F\u06E5 \u0628\u064E\u0639\u06E1\u062F\u064E \u062D\u0650\u064A\u0646\u0650\u06ED" }] }, { id: 39, name: "\u0627\u0644\u0632\u0645\u0631", transliteration: "Az-Zumar", type: "meccan", total_verses: 75, verses: [{ id: 1, text: "\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u0650" }, { id: 2, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u0657\u0627 \u0644\u0651\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E" }, { id: 3, text: "\u0623\u064E\u0644\u064E\u0627 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064F \u0671\u0644\u06E1\u062E\u064E\u0627\u0644\u0650\u0635\u064F\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u0646\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u064A\u064F\u0642\u064E\u0631\u0651\u0650\u0628\u064F\u0648\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0632\u064F\u0644\u06E1\u0641\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0645\u064E\u0627 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0643\u064E\u0670\u0630\u0650\u0628\u065E \u0643\u064E\u0641\u0651\u064E\u0627\u0631\u065E" }, { id: 4, text: "\u0644\u0651\u064E\u0648\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0648\u064E\u0644\u064E\u062F\u0657\u0627 \u0644\u0651\u064E\u0671\u0635\u06E1\u0637\u064E\u0641\u064E\u0649\u0670 \u0645\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5\u06D6 \u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0648\u064E\u0670\u062D\u0650\u062F\u064F \u0671\u0644\u06E1\u0642\u064E\u0647\u0651\u064E\u0627\u0631\u064F" }, { id: 5, text: "\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u064A\u064F\u0643\u064E\u0648\u0651\u0650\u0631\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u064A\u064F\u0643\u064E\u0648\u0651\u0650\u0631\u064F \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650\u06D6 \u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E\u06D6 \u0643\u064F\u0644\u0651\u065E \u064A\u064E\u062C\u06E1\u0631\u0650\u064A \u0644\u0650\u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u064B\u0649\u06D7 \u0623\u064E\u0644\u064E\u0627 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u063A\u064E\u0641\u0651\u064E\u0640\u0670\u0631\u064F" }, { id: 6, text: "\u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0656 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0639\u064E\u0644\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0632\u064E\u0648\u06E1\u062C\u064E\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u062B\u064E\u0645\u064E\u0670\u0646\u0650\u064A\u064E\u0629\u064E \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0656\u06DA \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0628\u064F\u0637\u064F\u0648\u0646\u0650 \u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1 \u062E\u064E\u0644\u06E1\u0642\u0657\u0627 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u062E\u064E\u0644\u06E1\u0642\u0656 \u0641\u0650\u064A \u0638\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0656 \u062B\u064E\u0644\u064E\u0670\u062B\u0656\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064F\u06D6 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u062A\u064F\u0635\u06E1\u0631\u064E\u0641\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0625\u0650\u0646 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0646\u0650\u064A\u0651\u064C \u0639\u064E\u0646\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670 \u0644\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650 \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u064A\u064E\u0631\u06E1\u0636\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0632\u0650\u0631\u064F \u0648\u064E\u0627\u0632\u0650\u0631\u064E\u0629\u065E \u0648\u0650\u0632\u06E1\u0631\u064E \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u06DA \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645 \u0645\u0651\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 8, text: "\u06DE\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0636\u064F\u0631\u0651\u065E \u062F\u064E\u0639\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u0645\u064F\u0646\u0650\u064A\u0628\u064B\u0627 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0630\u064E\u0627 \u062E\u064E\u0648\u0651\u064E\u0644\u064E\u0647\u064F\u06E5 \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0646\u064E\u0633\u0650\u064A\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646\u062F\u064E\u0627\u062F\u0657\u0627 \u0644\u0651\u0650\u064A\u064F\u0636\u0650\u0644\u0651\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6\u06DA \u0642\u064F\u0644\u06E1 \u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u06E1 \u0628\u0650\u0643\u064F\u0641\u06E1\u0631\u0650\u0643\u064E \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 9, text: "\u0623\u064E\u0645\u0651\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0642\u064E\u0670\u0646\u0650\u062A\u064C \u0621\u064E\u0627\u0646\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0633\u064E\u0627\u062C\u0650\u062F\u0657\u0627 \u0648\u064E\u0642\u064E\u0627\u0653\u0626\u0650\u0645\u0657\u0627 \u064A\u064E\u062D\u06E1\u0630\u064E\u0631\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E \u0648\u064E\u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0627\u0652 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06D7 \u0642\u064F\u0644\u06E1 \u0647\u064E\u0644\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E\u06D7 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 10, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0670\u0639\u0650\u0628\u064E\u0627\u062F\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1\u06DA \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u065E\u06D7 \u0648\u064E\u0623\u064E\u0631\u06E1\u0636\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0670\u0633\u0650\u0639\u064E\u0629\u064C\u06D7 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0648\u064E\u0641\u0651\u064E\u0649 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u064F\u0648\u0646\u064E \u0623\u064E\u062C\u06E1\u0631\u064E\u0647\u064F\u0645 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u0650\u0633\u064E\u0627\u0628\u0656" }, { id: 11, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u0657\u0627 \u0644\u0651\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0644\u0650\u0623\u064E\u0646\u06E1 \u0623\u064E\u0643\u064F\u0648\u0646\u064E \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 13, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0625\u0650\u0646\u06E1 \u0639\u064E\u0635\u064E\u064A\u06E1\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 14, text: "\u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u06E5 \u062F\u0650\u064A\u0646\u0650\u064A" }, { id: 15, text: "\u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0634\u0650\u0626\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u06D7 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0633\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u0650\u064A\u0647\u0650\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06D7 \u0623\u064E\u0644\u064E\u0627 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062E\u064F\u0633\u06E1\u0631\u064E\u0627\u0646\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 16, text: "\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u0650\u0645\u06E1 \u0638\u064F\u0644\u064E\u0644\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0648\u064E\u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u0650\u0645\u06E1 \u0638\u064F\u0644\u064E\u0644\u065E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u062E\u064E\u0648\u0651\u0650\u0641\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u0647\u064F\u06E5\u06DA \u064A\u064E\u0670\u0639\u0650\u0628\u064E\u0627\u062F\u0650 \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u0650" }, { id: 17, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062C\u06E1\u062A\u064E\u0646\u064E\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u0637\u0651\u064E\u0640\u0670\u063A\u064F\u0648\u062A\u064E \u0623\u064E\u0646 \u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670\u06DA \u0641\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650" }, { id: 18, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064E \u0641\u064E\u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E\u0647\u064F\u06E5\u0653\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u06E1 \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 19, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646\u06E1 \u062D\u064E\u0642\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0623\u064E\u0641\u064E\u0623\u064E\u0646\u062A\u064E \u062A\u064F\u0646\u0642\u0650\u0630\u064F \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 20, text: "\u0644\u064E\u0670\u0643\u0650\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u063A\u064F\u0631\u064E\u0641\u065E \u0645\u0651\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u064E\u0627 \u063A\u064F\u0631\u064E\u0641\u065E \u0645\u0651\u064E\u0628\u06E1\u0646\u0650\u064A\u0651\u064E\u0629\u065E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06D6 \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u064A\u064F\u062E\u06E1\u0644\u0650\u0641\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u0650\u064A\u0639\u064E\u0627\u062F\u064E" }, { id: 21, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0641\u064E\u0633\u064E\u0644\u064E\u0643\u064E\u0647\u064F\u06E5 \u064A\u064E\u0646\u064E\u0670\u0628\u0650\u064A\u0639\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F \u0628\u0650\u0647\u0650\u06E6 \u0632\u064E\u0631\u06E1\u0639\u0657\u0627 \u0645\u0651\u064F\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064B\u0627 \u0623\u064E\u0644\u06E1\u0648\u064E\u0670\u0646\u064F\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0647\u0650\u064A\u062C\u064F \u0641\u064E\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F \u0645\u064F\u0635\u06E1\u0641\u064E\u0631\u0651\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0647\u064F\u06E5 \u062D\u064F\u0637\u064E\u0670\u0645\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 22, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u0634\u064E\u0631\u064E\u062D\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0635\u064E\u062F\u06E1\u0631\u064E\u0647\u064F\u06E5 \u0644\u0650\u0644\u06E1\u0625\u0650\u0633\u06E1\u0644\u064E\u0670\u0645\u0650 \u0641\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064F\u0648\u0631\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6\u06DA \u0641\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0644\u06E1\u0642\u064E\u0670\u0633\u0650\u064A\u064E\u0629\u0650 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 23, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u062F\u0650\u064A\u062B\u0650 \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627 \u0645\u0651\u064F\u062A\u064E\u0634\u064E\u0670\u0628\u0650\u0647\u0657\u0627 \u0645\u0651\u064E\u062B\u064E\u0627\u0646\u0650\u064A\u064E \u062A\u064E\u0642\u06E1\u0634\u064E\u0639\u0650\u0631\u0651\u064F \u0645\u0650\u0646\u06E1\u0647\u064F \u062C\u064F\u0644\u064F\u0648\u062F\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0644\u0650\u064A\u0646\u064F \u062C\u064F\u0644\u064F\u0648\u062F\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u062F\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0647\u064E\u0627\u062F\u064D" }, { id: 24, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u0642\u0650\u064A \u0628\u0650\u0648\u064E\u062C\u06E1\u0647\u0650\u0647\u0650\u06E6 \u0633\u064F\u0648\u0653\u0621\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06DA \u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0644\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0641\u064E\u0623\u064E\u0630\u064E\u0627\u0642\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062E\u0650\u0632\u06E1\u064A\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0644\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u06DA \u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0636\u064E\u0631\u064E\u0628\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0641\u0650\u064A \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0645\u064E\u062B\u064E\u0644\u0656 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064B\u0627 \u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E \u0630\u0650\u064A \u0639\u0650\u0648\u064E\u062C\u0656 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0636\u064E\u0631\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0631\u0651\u064E\u062C\u064F\u0644\u0657\u0627 \u0641\u0650\u064A\u0647\u0650 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064F \u0645\u064F\u062A\u064E\u0634\u064E\u0670\u0643\u0650\u0633\u064F\u0648\u0646\u064E \u0648\u064E\u0631\u064E\u062C\u064F\u0644\u0657\u0627 \u0633\u064E\u0644\u064E\u0645\u0657\u0627 \u0644\u0651\u0650\u0631\u064E\u062C\u064F\u0644\u064D \u0647\u064E\u0644\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A\u064E\u0627\u0646\u0650 \u0645\u064E\u062B\u064E\u0644\u064B\u0627\u06DA \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0645\u064E\u064A\u0651\u0650\u062A\u065E \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u064A\u0651\u0650\u062A\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u062A\u064E\u062E\u06E1\u062A\u064E\u0635\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u06DE\u0641\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646 \u0643\u064E\u0630\u064E\u0628\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0628\u0650\u0671\u0644\u0635\u0651\u0650\u062F\u06E1\u0642\u0650 \u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u06E5\u0653\u06DA \u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0641\u0650\u064A \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0645\u064E\u062B\u06E1\u0648\u0657\u0649 \u0644\u0651\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u0635\u0651\u0650\u062F\u06E1\u0642\u0650 \u0648\u064E\u0635\u064E\u062F\u0651\u064E\u0642\u064E \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u0648\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 35, text: "\u0644\u0650\u064A\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0633\u06E1\u0648\u064E\u0623\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064E\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064E\u0627\u0641\u064D \u0639\u064E\u0628\u06E1\u062F\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u064A\u064F\u062E\u064E\u0648\u0651\u0650\u0641\u064F\u0648\u0646\u064E\u0643\u064E \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0647\u064E\u0627\u062F\u0656" }, { id: 37, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0645\u0651\u064F\u0636\u0650\u0644\u0651\u064D\u06D7 \u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0639\u064E\u0632\u0650\u064A\u0632\u0656 \u0630\u0650\u064A \u0671\u0646\u062A\u0650\u0642\u064E\u0627\u0645\u0656" }, { id: 38, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0642\u064F\u0644\u06E1 \u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E\u0646\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0636\u064F\u0631\u0651\u064D \u0647\u064E\u0644\u06E1 \u0647\u064F\u0646\u0651\u064E \u0643\u064E\u0670\u0634\u0650\u0641\u064E\u0670\u062A\u064F \u0636\u064F\u0631\u0651\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E\u0646\u0650\u064A \u0628\u0650\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u064D \u0647\u064E\u0644\u06E1 \u0647\u064F\u0646\u0651\u064E \u0645\u064F\u0645\u06E1\u0633\u0650\u0643\u064E\u0670\u062A\u064F \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6\u06DA \u0642\u064F\u0644\u06E1 \u062D\u064E\u0633\u06E1\u0628\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0648\u064E\u0643\u0651\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0639\u064E\u0670\u0645\u0650\u0644\u065E\u06D6 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0645\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u064A\u064F\u062E\u06E1\u0632\u0650\u064A\u0647\u0650 \u0648\u064E\u064A\u064E\u062D\u0650\u0644\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0642\u0650\u064A\u0645\u064C" }, { id: 41, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0649\u0670 \u0641\u064E\u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0636\u064E\u0644\u0651\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0636\u0650\u0644\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0648\u064E\u0643\u0650\u064A\u0644\u064D" }, { id: 42, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0646\u0641\u064F\u0633\u064E \u062D\u0650\u064A\u0646\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627 \u0648\u064E\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0644\u064E\u0645\u06E1 \u062A\u064E\u0645\u064F\u062A\u06E1 \u0641\u0650\u064A \u0645\u064E\u0646\u064E\u0627\u0645\u0650\u0647\u064E\u0627\u06D6 \u0641\u064E\u064A\u064F\u0645\u06E1\u0633\u0650\u0643\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0642\u064E\u0636\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E \u0648\u064E\u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064F \u0671\u0644\u06E1\u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u064B\u0649\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0623\u064E\u0645\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064F\u0641\u064E\u0639\u064E\u0627\u0653\u0621\u064E\u06DA \u0642\u064F\u0644\u06E1 \u0623\u064E\u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0634\u0651\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u064F \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627\u06D6 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0630\u064F\u0643\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u062D\u06E1\u062F\u064E\u0647\u064F \u0671\u0634\u06E1\u0645\u064E\u0623\u064E\u0632\u0651\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D6 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0630\u064F\u0643\u0650\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0628\u06E1\u0634\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u0645\u0651\u064E \u0641\u064E\u0627\u0637\u0650\u0631\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0639\u064E\u0670\u0644\u0650\u0645\u064E \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650 \u0623\u064E\u0646\u062A\u064E \u062A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u064E\u064A\u06E1\u0646\u064E \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0643\u064E \u0641\u0650\u064A \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0648\u064E\u0645\u0650\u062B\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0644\u064E\u0671\u0641\u06E1\u062A\u064E\u062F\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646 \u0633\u064F\u0648\u0653\u0621\u0650 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06DA \u0648\u064E\u0628\u064E\u062F\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u062D\u06E1\u062A\u064E\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0628\u064E\u062F\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u064F \u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u062D\u064E\u0627\u0642\u064E \u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0636\u064F\u0631\u0651\u065E \u062F\u064E\u0639\u064E\u0627\u0646\u064E\u0627 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0630\u064E\u0627 \u062E\u064E\u0648\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u062A\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u0650\u0644\u06E1\u0645\u0650\u06ED\u06DA \u0628\u064E\u0644\u06E1 \u0647\u0650\u064A\u064E \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0642\u064E\u062F\u06E1 \u0642\u064E\u0627\u0644\u064E\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0641\u064E\u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u064F \u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0633\u064E\u064A\u064F\u0635\u0650\u064A\u0628\u064F\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u064F \u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0628\u0650\u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A\u0646\u064E" }, { id: 52, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 53, text: "\u06DE\u0642\u064F\u0644\u06E1 \u064A\u064E\u0670\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0633\u06E1\u0631\u064E\u0641\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0646\u064E\u0637\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0671\u0644\u0630\u0651\u064F\u0646\u064F\u0648\u0628\u064E \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 54, text: "\u0648\u064E\u0623\u064E\u0646\u0650\u064A\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u062A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 55, text: "\u0648\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0645\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 56, text: "\u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064E \u0646\u064E\u0641\u06E1\u0633\u065E \u064A\u064E\u0670\u062D\u064E\u0633\u06E1\u0631\u064E\u062A\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0641\u064E\u0631\u0651\u064E\u0637\u062A\u064F \u0641\u0650\u064A \u062C\u064E\u0646\u06E2\u0628\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F \u0644\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0640\u0670\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 57, text: "\u0623\u064E\u0648\u06E1 \u062A\u064E\u0642\u064F\u0648\u0644\u064E \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064E\u062F\u064E\u0649\u0670\u0646\u0650\u064A \u0644\u064E\u0643\u064F\u0646\u062A\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 58, text: "\u0623\u064E\u0648\u06E1 \u062A\u064E\u0642\u064F\u0648\u0644\u064E \u062D\u0650\u064A\u0646\u064E \u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E \u0644\u0650\u064A \u0643\u064E\u0631\u0651\u064E\u0629\u0657 \u0641\u064E\u0623\u064E\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 59, text: "\u0628\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u06E1\u062A\u064E \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u06E1\u062A\u064E \u0648\u064E\u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 60, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u064E\u0628\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064F\u062C\u064F\u0648\u0647\u064F\u0647\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u0648\u064E\u062F\u0651\u064E\u0629\u064C\u06DA \u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0641\u0650\u064A \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0645\u064E\u062B\u06E1\u0648\u0657\u0649 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062A\u064E\u0643\u064E\u0628\u0651\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 61, text: "\u0648\u064E\u064A\u064F\u0646\u064E\u062C\u0651\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0645\u064E\u0641\u064E\u0627\u0632\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0645\u064E\u0633\u0651\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u064F \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u0670\u0644\u0650\u0642\u064F \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0648\u064E\u0643\u0650\u064A\u0644\u065E" }, { id: 63, text: "\u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u0642\u064E\u0627\u0644\u0650\u064A\u062F\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0641\u064E\u063A\u064E\u064A\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0653\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0634\u06E1\u0631\u064E\u0643\u06E1\u062A\u064E \u0644\u064E\u064A\u064E\u062D\u06E1\u0628\u064E\u0637\u064E\u0646\u0651\u064E \u0639\u064E\u0645\u064E\u0644\u064F\u0643\u064E \u0648\u064E\u0644\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 66, text: "\u0628\u064E\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u06E1 \u0648\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0643\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 67, text: "\u0648\u064E\u0645\u064E\u0627 \u0642\u064E\u062F\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062D\u064E\u0642\u0651\u064E \u0642\u064E\u062F\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0642\u064E\u0628\u06E1\u0636\u064E\u062A\u064F\u0647\u064F\u06E5 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u064F \u0645\u064E\u0637\u06E1\u0648\u0650\u064A\u0651\u064E\u0640\u0670\u062A\u064F\u06E2 \u0628\u0650\u064A\u064E\u0645\u0650\u064A\u0646\u0650\u0647\u0650\u06E6\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0648\u064E\u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649\u0670 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0648\u064E\u0646\u064F\u0641\u0650\u062E\u064E \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u0648\u0631\u0650 \u0641\u064E\u0635\u064E\u0639\u0650\u0642\u064E \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u062B\u064F\u0645\u0651\u064E \u0646\u064F\u0641\u0650\u062E\u064E \u0641\u0650\u064A\u0647\u0650 \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u0642\u0650\u064A\u064E\u0627\u0645\u065E \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u0648\u064E\u0623\u064E\u0634\u06E1\u0631\u064E\u0642\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0628\u0650\u0646\u064F\u0648\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u064E\u0627 \u0648\u064E\u0648\u064F\u0636\u0650\u0639\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064F \u0648\u064E\u062C\u0650\u0627\u0652\u064A\u0653\u0621\u064E \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0648\u064E\u0671\u0644\u0634\u0651\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0648\u064E\u0648\u064F\u0641\u0651\u0650\u064A\u064E\u062A\u06E1 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0645\u0651\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064E\u062A\u06E1 \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0648\u064E\u0633\u0650\u064A\u0642\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0632\u064F\u0645\u064E\u0631\u064B\u0627\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0647\u064E\u0627 \u0641\u064F\u062A\u0650\u062D\u064E\u062A\u06E1 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u064F\u0647\u064E\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062E\u064E\u0632\u064E\u0646\u064E\u062A\u064F\u0647\u064E\u0627\u0653 \u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u0643\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u065E \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u0646\u0630\u0650\u0631\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E \u064A\u064E\u0648\u06E1\u0645\u0650\u0643\u064F\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u06E1 \u062D\u064E\u0642\u0651\u064E\u062A\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 72, text: "\u0642\u0650\u064A\u0644\u064E \u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0641\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u062B\u06E1\u0648\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0643\u064E\u0628\u0651\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 73, text: "\u0648\u064E\u0633\u0650\u064A\u0642\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0642\u064E\u0648\u06E1\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0632\u064F\u0645\u064E\u0631\u064B\u0627\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0647\u064E\u0627 \u0648\u064E\u0641\u064F\u062A\u0650\u062D\u064E\u062A\u06E1 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u064F\u0647\u064E\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062E\u064E\u0632\u064E\u0646\u064E\u062A\u064F\u0647\u064E\u0627 \u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0637\u0650\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 74, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0635\u064E\u062F\u064E\u0642\u064E\u0646\u064E\u0627 \u0648\u064E\u0639\u06E1\u062F\u064E\u0647\u064F\u06E5 \u0648\u064E\u0623\u064E\u0648\u06E1\u0631\u064E\u062B\u064E\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0646\u064E\u062A\u064E\u0628\u064E\u0648\u0651\u064E\u0623\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u062D\u064E\u064A\u06E1\u062B\u064F \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0641\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u0623\u064E\u062C\u06E1\u0631\u064F \u0671\u0644\u06E1\u0639\u064E\u0670\u0645\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 75, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064E \u062D\u064E\u0627\u0653\u0641\u0651\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u062D\u064E\u0648\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0646\u064E \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }] }, { id: 40, name: "\u063A\u0627\u0641\u0631", transliteration: "Ghafir", type: "meccan", total_verses: 85, verses: [{ id: 1, text: "\u062D\u0645\u0653" }, { id: 2, text: "\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u0650" }, { id: 3, text: "\u063A\u064E\u0627\u0641\u0650\u0631\u0650 \u0671\u0644\u0630\u0651\u064E\u0646\u06E2\u0628\u0650 \u0648\u064E\u0642\u064E\u0627\u0628\u0650\u0644\u0650 \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0628\u0650 \u0634\u064E\u062F\u0650\u064A\u062F\u0650 \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650 \u0630\u0650\u064A \u0671\u0644\u0637\u0651\u064E\u0648\u06E1\u0644\u0650\u06D6 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 4, text: "\u0645\u064E\u0627 \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u063A\u06E1\u0631\u064F\u0631\u06E1\u0643\u064E \u062A\u064E\u0642\u064E\u0644\u0651\u064F\u0628\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u0650\u0644\u064E\u0670\u062F\u0650" }, { id: 5, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064F \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0647\u064E\u0645\u0651\u064E\u062A\u06E1 \u0643\u064F\u0644\u0651\u064F \u0623\u064F\u0645\u0651\u064E\u0629\u0650\u06ED \u0628\u0650\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u0645\u06E1 \u0644\u0650\u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0647\u064F\u06D6 \u0648\u064E\u062C\u064E\u0670\u062F\u064E\u0644\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u0650 \u0644\u0650\u064A\u064F\u062F\u06E1\u062D\u0650\u0636\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 6, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062D\u064E\u0642\u0651\u064E\u062A\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 7, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u064E \u0648\u064E\u0645\u064E\u0646\u06E1 \u062D\u064E\u0648\u06E1\u0644\u064E\u0647\u064F\u06E5 \u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0646\u064E \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652\u06D6 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u0633\u0650\u0639\u06E1\u062A\u064E \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u0656 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0648\u064E\u0639\u0650\u0644\u06E1\u0645\u0657\u0627 \u0641\u064E\u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0633\u064E\u0628\u0650\u064A\u0644\u064E\u0643\u064E \u0648\u064E\u0642\u0650\u0647\u0650\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 8, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u062F\u06E1\u062E\u0650\u0644\u06E1\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0639\u064E\u062F\u06E1\u0646\u064D \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0648\u064E\u0639\u064E\u062F\u062A\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0646 \u0635\u064E\u0644\u064E\u062D\u064E \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u0640\u0670\u062A\u0650\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 9, text: "\u0648\u064E\u0642\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u062A\u064E\u0642\u0650 \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0631\u064E\u062D\u0650\u0645\u06E1\u062A\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 10, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u064A\u064F\u0646\u064E\u0627\u062F\u064E\u0648\u06E1\u0646\u064E \u0644\u064E\u0645\u064E\u0642\u06E1\u062A\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u0645\u0650\u0646 \u0645\u0651\u064E\u0642\u06E1\u062A\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u062A\u064F\u062F\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650 \u0641\u064E\u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0645\u064E\u062A\u0651\u064E\u0646\u064E\u0627 \u0671\u062B\u06E1\u0646\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0623\u064E\u062D\u06E1\u064A\u064E\u064A\u06E1\u062A\u064E\u0646\u064E\u0627 \u0671\u062B\u06E1\u0646\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u0671\u0639\u06E1\u062A\u064E\u0631\u064E\u0641\u06E1\u0646\u064E\u0627 \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0646\u064E\u0627 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u062E\u064F\u0631\u064F\u0648\u062C\u0656 \u0645\u0651\u0650\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0656" }, { id: 12, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645 \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0630\u064E\u0627 \u062F\u064F\u0639\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u062D\u06E1\u062F\u064E\u0647\u064F\u06E5 \u0643\u064E\u0641\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0625\u0650\u0646 \u064A\u064F\u0634\u06E1\u0631\u064E\u0643\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652\u06DA \u0641\u064E\u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0651\u0650 \u0671\u0644\u06E1\u0643\u064E\u0628\u0650\u064A\u0631\u0650" }, { id: 13, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0631\u0650\u064A\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0631\u0650\u0632\u06E1\u0642\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u064A\u064F\u0646\u0650\u064A\u0628\u064F" }, { id: 14, text: "\u0641\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u0650\u064A\u0646\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0631\u0650\u0647\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0631\u064E\u0641\u0650\u064A\u0639\u064F \u0671\u0644\u062F\u0651\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u0650 \u0630\u064F\u0648 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u064A\u064F\u0644\u06E1\u0642\u0650\u064A \u0671\u0644\u0631\u0651\u064F\u0648\u062D\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u0644\u0650\u064A\u064F\u0646\u0630\u0650\u0631\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u062A\u0651\u064E\u0644\u064E\u0627\u0642\u0650" }, { id: 16, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0647\u064F\u0645 \u0628\u064E\u0670\u0631\u0650\u0632\u064F\u0648\u0646\u064E\u06D6 \u0644\u064E\u0627 \u064A\u064E\u062E\u06E1\u0641\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0621\u065E\u06DA \u0644\u0651\u0650\u0645\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E\u06D6 \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0648\u064E\u0670\u062D\u0650\u062F\u0650 \u0671\u0644\u06E1\u0642\u064E\u0647\u0651\u064E\u0627\u0631\u0650" }, { id: 17, text: "\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064F\u062C\u06E1\u0632\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1\u06DA \u0644\u064E\u0627 \u0638\u064F\u0644\u06E1\u0645\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0631\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 18, text: "\u0648\u064E\u0623\u064E\u0646\u0630\u0650\u0631\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0623\u0653\u0632\u0650\u0641\u064E\u0629\u0650 \u0625\u0650\u0630\u0650 \u0671\u0644\u06E1\u0642\u064F\u0644\u064F\u0648\u0628\u064F \u0644\u064E\u062F\u064E\u0649 \u0671\u0644\u06E1\u062D\u064E\u0646\u064E\u0627\u062C\u0650\u0631\u0650 \u0643\u064E\u0670\u0638\u0650\u0645\u0650\u064A\u0646\u064E\u06DA \u0645\u064E\u0627 \u0644\u0650\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u062D\u064E\u0645\u0650\u064A\u0645\u0656 \u0648\u064E\u0644\u064E\u0627 \u0634\u064E\u0641\u0650\u064A\u0639\u0656 \u064A\u064F\u0637\u064E\u0627\u0639\u064F" }, { id: 19, text: "\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u062E\u064E\u0627\u0653\u0626\u0650\u0646\u064E\u0629\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0650 \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u062E\u06E1\u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u064F" }, { id: 20, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0642\u06E1\u0636\u0650\u064A \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0644\u064E\u0627 \u064A\u064E\u0642\u06E1\u0636\u064F\u0648\u0646\u064E \u0628\u0650\u0634\u064E\u064A\u06E1\u0621\u064D\u06D7 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0628\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 21, text: "\u06DE\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0647\u064F\u0645\u06E1 \u0623\u064E\u0634\u064E\u062F\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0642\u064F\u0648\u0651\u064E\u0629\u0657 \u0648\u064E\u0621\u064E\u0627\u062B\u064E\u0627\u0631\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0648\u064E\u0627\u0642\u0656" }, { id: 22, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064E\u062A \u062A\u0651\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0642\u064E\u0648\u0650\u064A\u0651\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 23, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 24, text: "\u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0647\u064E\u0670\u0645\u064E\u0670\u0646\u064E \u0648\u064E\u0642\u064E\u0670\u0631\u064F\u0648\u0646\u064E \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0670\u062D\u0650\u0631\u065E \u0643\u064E\u0630\u0651\u064E\u0627\u0628\u065E" }, { id: 25, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0646\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u062D\u06E1\u064A\u064F\u0648\u0627\u0652 \u0646\u0650\u0633\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u064A\u06E1\u062F\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656" }, { id: 26, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0630\u064E\u0631\u064F\u0648\u0646\u0650\u064A\u0653 \u0623\u064E\u0642\u06E1\u062A\u064F\u0644\u06E1 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0644\u06E1\u064A\u064E\u062F\u06E1\u0639\u064F \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5\u0653\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0623\u064E\u0646 \u064A\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064E \u062F\u0650\u064A\u0646\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0646 \u064A\u064F\u0638\u06E1\u0647\u0650\u0631\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0671\u0644\u06E1\u0641\u064E\u0633\u064E\u0627\u062F\u064E" }, { id: 27, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u0650\u064A \u0639\u064F\u0630\u06E1\u062A\u064F \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0645\u064F\u062A\u064E\u0643\u064E\u0628\u0651\u0650\u0631\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u062D\u0650\u0633\u064E\u0627\u0628\u0650" }, { id: 28, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u062C\u064F\u0644\u065E \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u065E \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u0644\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u064A\u064E\u0643\u06E1\u062A\u064F\u0645\u064F \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062A\u064E\u0642\u06E1\u062A\u064F\u0644\u064F\u0648\u0646\u064E \u0631\u064E\u062C\u064F\u0644\u064B\u0627 \u0623\u064E\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064E \u0631\u064E\u0628\u0651\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0643\u064F \u0643\u064E\u0670\u0630\u0650\u0628\u0657\u0627 \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u064F\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0643\u064F \u0635\u064E\u0627\u062F\u0650\u0642\u0657\u0627 \u064A\u064F\u0635\u0650\u0628\u06E1\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0639\u0650\u062F\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u065E \u0643\u064E\u0630\u0651\u064E\u0627\u0628\u065E" }, { id: 29, text: "\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0638\u064E\u0670\u0647\u0650\u0631\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0646\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0623\u06E1\u0633\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u0650\u064A\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0647\u06E1\u062F\u0650\u064A\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u064E\u0628\u0650\u064A\u0644\u064E \u0671\u0644\u0631\u0651\u064E\u0634\u064E\u0627\u062F\u0650" }, { id: 30, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u062B\u06E1\u0644\u064E \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u0650" }, { id: 31, text: "\u0645\u0650\u062B\u06E1\u0644\u064E \u062F\u064E\u0623\u06E1\u0628\u0650 \u0642\u064E\u0648\u06E1\u0645\u0650 \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0639\u064E\u0627\u062F\u0656 \u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0638\u064F\u0644\u06E1\u0645\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0639\u0650\u0628\u064E\u0627\u062F\u0650" }, { id: 32, text: "\u0648\u064E\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u062A\u0651\u064E\u0646\u064E\u0627\u062F\u0650" }, { id: 33, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064F\u0648\u064E\u0644\u0651\u064F\u0648\u0646\u064E \u0645\u064F\u062F\u06E1\u0628\u0650\u0631\u0650\u064A\u0646\u064E \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E1 \u0639\u064E\u0627\u0635\u0650\u0645\u0656\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0647\u064E\u0627\u062F\u0656" }, { id: 34, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u064A\u064F\u0648\u0633\u064F\u0641\u064F \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0645\u064E\u0627 \u0632\u0650\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0647\u064E\u0644\u064E\u0643\u064E \u0642\u064F\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0646 \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0636\u0650\u0644\u0651\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u065E \u0645\u0651\u064F\u0631\u06E1\u062A\u064E\u0627\u0628\u064C" }, { id: 35, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u064D \u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u06E1\u06D6 \u0643\u064E\u0628\u064F\u0631\u064E \u0645\u064E\u0642\u06E1\u062A\u064B\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0637\u06E1\u0628\u064E\u0639\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0642\u064E\u0644\u06E1\u0628\u0650 \u0645\u064F\u062A\u064E\u0643\u064E\u0628\u0651\u0650\u0631\u0656 \u062C\u064E\u0628\u0651\u064E\u0627\u0631\u0656" }, { id: 36, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u064A\u064E\u0670\u0647\u064E\u0670\u0645\u064E\u0670\u0646\u064F \u0671\u0628\u06E1\u0646\u0650 \u0644\u0650\u064A \u0635\u064E\u0631\u06E1\u062D\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u0650\u064A\u0653 \u0623\u064E\u0628\u06E1\u0644\u064F\u063A\u064F \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0628\u064E\u0670\u0628\u064E" }, { id: 37, text: "\u0623\u064E\u0633\u06E1\u0628\u064E\u0670\u0628\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0641\u064E\u0623\u064E\u0637\u0651\u064E\u0644\u0650\u0639\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0623\u064E\u0638\u064F\u0646\u0651\u064F\u0647\u064F\u06E5 \u0643\u064E\u0670\u0630\u0650\u0628\u0657\u0627\u06DA \u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0632\u064F\u064A\u0651\u0650\u0646\u064E \u0644\u0650\u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0633\u064F\u0648\u0653\u0621\u064F \u0639\u064E\u0645\u064E\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0635\u064F\u062F\u0651\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u064A\u06E1\u062F\u064F \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u062A\u064E\u0628\u064E\u0627\u0628\u0656" }, { id: 38, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u0650 \u0623\u064E\u0647\u06E1\u062F\u0650\u0643\u064F\u0645\u06E1 \u0633\u064E\u0628\u0650\u064A\u0644\u064E \u0671\u0644\u0631\u0651\u064E\u0634\u064E\u0627\u062F\u0650" }, { id: 39, text: "\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0645\u064E\u062A\u064E\u0670\u0639\u065E \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E \u0647\u0650\u064A\u064E \u062F\u064E\u0627\u0631\u064F \u0671\u0644\u06E1\u0642\u064E\u0631\u064E\u0627\u0631\u0650" }, { id: 40, text: "\u0645\u064E\u0646\u06E1 \u0639\u064E\u0645\u0650\u0644\u064E \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0657 \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u062C\u06E1\u0632\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u062B\u06E1\u0644\u064E\u0647\u064E\u0627\u06D6 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0645\u0651\u0650\u0646 \u0630\u064E\u0643\u064E\u0631\u064D \u0623\u064E\u0648\u06E1 \u0623\u064F\u0646\u062B\u064E\u0649\u0670 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u065E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u064A\u064F\u0631\u06E1\u0632\u064E\u0642\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u062D\u0650\u0633\u064E\u0627\u0628\u0656" }, { id: 41, text: "\u06DE\u0648\u064E\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0645\u064E\u0627 \u0644\u0650\u064A\u0653 \u0623\u064E\u062F\u06E1\u0639\u064F\u0648\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u062C\u064E\u0648\u0670\u0629\u0650 \u0648\u064E\u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 42, text: "\u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E\u0646\u0650\u064A \u0644\u0650\u0623\u064E\u0643\u06E1\u0641\u064F\u0631\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064F\u0634\u06E1\u0631\u0650\u0643\u064E \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u0650\u064A \u0628\u0650\u0647\u0650\u06E6 \u0639\u0650\u0644\u06E1\u0645\u065E \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0623\u064E\u062F\u06E1\u0639\u064F\u0648\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u063A\u064E\u0641\u0651\u064E\u0640\u0670\u0631\u0650" }, { id: 43, text: "\u0644\u064E\u0627 \u062C\u064E\u0631\u064E\u0645\u064E \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064F\u06E5 \u062F\u064E\u0639\u06E1\u0648\u064E\u0629\u065E \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0645\u064E\u0631\u064E\u062F\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 44, text: "\u0641\u064E\u0633\u064E\u062A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0623\u064F\u0641\u064E\u0648\u0651\u0650\u0636\u064F \u0623\u064E\u0645\u06E1\u0631\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0639\u0650\u0628\u064E\u0627\u062F\u0650" }, { id: 45, text: "\u0641\u064E\u0648\u064E\u0642\u064E\u0649\u0670\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u0645\u064E\u0627 \u0645\u064E\u0643\u064E\u0631\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u062D\u064E\u0627\u0642\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u0644\u0650 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0633\u064F\u0648\u0653\u0621\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650" }, { id: 46, text: "\u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u064A\u064F\u0639\u06E1\u0631\u064E\u0636\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u063A\u064F\u062F\u064F\u0648\u0651\u0657\u0627 \u0648\u064E\u0639\u064E\u0634\u0650\u064A\u0651\u0657\u0627\u06DA \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0642\u064F\u0648\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u0623\u064E\u062F\u06E1\u062E\u0650\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0623\u064E\u0634\u064E\u062F\u0651\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650" }, { id: 47, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u064A\u064E\u062A\u064E\u062D\u064E\u0627\u0653\u062C\u0651\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0636\u0651\u064F\u0639\u064E\u0641\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0628\u064E\u0639\u0657\u0627 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u063A\u06E1\u0646\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u0651\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0628\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 48, text: "\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0644\u0651\u065E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u062F\u06E1 \u062D\u064E\u0643\u064E\u0645\u064E \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0639\u0650\u0628\u064E\u0627\u062F\u0650" }, { id: 49, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0644\u0650\u062E\u064E\u0632\u064E\u0646\u064E\u0629\u0650 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u064A\u064F\u062E\u064E\u0641\u0651\u0650\u0641\u06E1 \u0639\u064E\u0646\u0651\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650" }, { id: 50, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u0643\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u064E\u0649\u0670\u06DA \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0645\u064E\u0627 \u062F\u064F\u0639\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u064D" }, { id: 51, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u0646\u0635\u064F\u0631\u064F \u0631\u064F\u0633\u064F\u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0642\u064F\u0648\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0634\u06E1\u0647\u064E\u0670\u062F\u064F" }, { id: 52, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u064A\u064E\u0646\u0641\u064E\u0639\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u064E\u0639\u06E1\u0630\u0650\u0631\u064E\u062A\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0639\u06E1\u0646\u064E\u0629\u064F \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064F\u0648\u0653\u0621\u064F \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u0650" }, { id: 53, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u0648\u06E1\u0631\u064E\u062B\u06E1\u0646\u064E\u0627 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E" }, { id: 54, text: "\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650" }, { id: 55, text: "\u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0625\u0650\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u065E \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u0650\u0630\u064E\u0646\u06E2\u0628\u0650\u0643\u064E \u0648\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0634\u0650\u064A\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0628\u06E1\u0643\u064E\u0670\u0631\u0650" }, { id: 56, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u064D \u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u0650\u0628\u06E1\u0631\u065E \u0645\u0651\u064E\u0627 \u0647\u064F\u0645 \u0628\u0650\u0628\u064E\u0670\u0644\u0650\u063A\u0650\u064A\u0647\u0650\u06DA \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0639\u0650\u0630\u06E1 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0628\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 57, text: "\u0644\u064E\u062E\u064E\u0644\u06E1\u0642\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0642\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0635\u0650\u064A\u0631\u064F \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0633\u0650\u064A\u0653\u0621\u064F\u06DA \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u062A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0644\u064E\u0623\u0653\u062A\u0650\u064A\u064E\u0629\u065E \u0644\u0651\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u064F \u0671\u062F\u06E1\u0639\u064F\u0648\u0646\u0650\u064A\u0653 \u0623\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u0628\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u062A\u0650\u064A \u0633\u064E\u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0646\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062F\u064E\u0627\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 61, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0644\u0650\u062A\u064E\u0633\u06E1\u0643\u064F\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0645\u064F\u0628\u06E1\u0635\u0650\u0631\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0630\u064F\u0648 \u0641\u064E\u0636\u06E1\u0644\u064D \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u062E\u064E\u0670\u0644\u0650\u0642\u064F \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u062A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u062C\u06E1\u062D\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0642\u064E\u0631\u064E\u0627\u0631\u0657\u0627 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0646\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u0635\u064E\u0648\u0651\u064E\u0631\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0635\u064F\u0648\u064E\u0631\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0632\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u062A\u064E\u0628\u064E\u0627\u0631\u064E\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 65, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u0651\u064F \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0641\u064E\u0671\u062F\u06E1\u0639\u064F\u0648\u0647\u064F \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u0650\u064A\u0646\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E\u06D7 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 66, text: "\u06DE\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0646\u064F\u0647\u0650\u064A\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0646\u0650\u064A\u064E \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0623\u064E\u0646\u06E1 \u0623\u064F\u0633\u06E1\u0644\u0650\u0645\u064E \u0644\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 67, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062A\u064F\u0631\u064E\u0627\u0628\u0656 \u062B\u064F\u0645\u0651\u064E \u0645\u0650\u0646 \u0646\u0651\u064F\u0637\u06E1\u0641\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u0645\u0650\u0646\u06E1 \u0639\u064E\u0644\u064E\u0642\u064E\u0629\u0656 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0643\u064F\u0645\u06E1 \u0637\u0650\u0641\u06E1\u0644\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u0644\u0650\u062A\u064E\u0628\u06E1\u0644\u064F\u063A\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0634\u064F\u062F\u0651\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0644\u0650\u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0634\u064F\u064A\u064F\u0648\u062E\u0657\u0627\u06DA \u0648\u064E\u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064F\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u0649\u0670 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0648\u064E\u0644\u0650\u062A\u064E\u0628\u06E1\u0644\u064F\u063A\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062C\u064E\u0644\u0657\u0627 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u064A\u064F\u0645\u0650\u064A\u062A\u064F\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0636\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0631\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u064E\u0647\u064F\u06E5 \u0643\u064F\u0646 \u0641\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F" }, { id: 69, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064F\u0635\u06E1\u0631\u064E\u0641\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0631\u064F\u0633\u064F\u0644\u064E\u0646\u064E\u0627\u06D6 \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0625\u0650\u0630\u0650 \u0671\u0644\u06E1\u0623\u064E\u063A\u06E1\u0644\u064E\u0670\u0644\u064F \u0641\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0646\u064E\u0670\u0642\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0670\u0633\u0650\u0644\u064F \u064A\u064F\u0633\u06E1\u062D\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u0645\u0650 \u062B\u064F\u0645\u0651\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u064A\u064F\u0633\u06E1\u062C\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u062B\u064F\u0645\u0651\u064E \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u064A\u06E1\u0646\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 74, text: "\u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u0651\u064E\u0627 \u0628\u064E\u0644 \u0644\u0651\u064E\u0645\u06E1 \u0646\u064E\u0643\u064F\u0646 \u0646\u0651\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0636\u0650\u0644\u0651\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 75, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0641\u06E1\u0631\u064E\u062D\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0645\u06E1\u0631\u064E\u062D\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0641\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u062B\u06E1\u0648\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0643\u064E\u0628\u0651\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 77, text: "\u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0625\u0650\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u065E\u06DA \u0641\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u0646\u064F\u0631\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0628\u064E\u0639\u06E1\u0636\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0646\u064E\u0639\u0650\u062F\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0646\u064E\u062A\u064E\u0648\u064E\u0641\u0651\u064E\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0641\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u064A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 78, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0631\u064F\u0633\u064F\u0644\u0657\u0627 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u0642\u064E\u0635\u064E\u0635\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u0646\u064E\u0642\u06E1\u0635\u064F\u0635\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0631\u064E\u0633\u064F\u0648\u0644\u064D \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0642\u064F\u0636\u0650\u064A\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u062E\u064E\u0633\u0650\u0631\u064E \u0647\u064F\u0646\u064E\u0627\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0645\u064F\u0628\u06E1\u0637\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 79, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u064E \u0644\u0650\u062A\u064E\u0631\u06E1\u0643\u064E\u0628\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 80, text: "\u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0646\u064E\u0670\u0641\u0650\u0639\u064F \u0648\u064E\u0644\u0650\u062A\u064E\u0628\u06E1\u0644\u064F\u063A\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u062D\u064E\u0627\u062C\u064E\u0629\u0657 \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u062A\u064F\u062D\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0648\u064E\u064A\u064F\u0631\u0650\u064A\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0641\u064E\u0623\u064E\u064A\u0651\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064F\u0646\u0643\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 82, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0634\u064E\u062F\u0651\u064E \u0642\u064F\u0648\u0651\u064E\u0629\u0657 \u0648\u064E\u0621\u064E\u0627\u062B\u064E\u0627\u0631\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0631\u0650\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650 \u0648\u064E\u062D\u064E\u0627\u0642\u064E \u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 84, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0627\u0652 \u0628\u064E\u0623\u06E1\u0633\u064E\u0646\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u062D\u06E1\u062F\u064E\u0647\u064F\u06E5 \u0648\u064E\u0643\u064E\u0641\u064E\u0631\u06E1\u0646\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 85, text: "\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F \u064A\u064E\u0646\u0641\u064E\u0639\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0627\u0652 \u0628\u064E\u0623\u06E1\u0633\u064E\u0646\u064E\u0627\u06D6 \u0633\u064F\u0646\u0651\u064E\u062A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0641\u0650\u064A \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u062E\u064E\u0633\u0650\u0631\u064E \u0647\u064F\u0646\u064E\u0627\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }] }, { id: 41, name: "\u0641\u0635\u0644\u062A", transliteration: "Fussilat", type: "meccan", total_verses: 54, verses: [{ id: 1, text: "\u062D\u0645\u0653" }, { id: 2, text: "\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 3, text: "\u0643\u0650\u062A\u064E\u0670\u0628\u065E \u0641\u064F\u0635\u0651\u0650\u0644\u064E\u062A\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0647\u064F\u06E5 \u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064B\u0627 \u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u0657\u0627 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0628\u064E\u0634\u0650\u064A\u0631\u0657\u0627 \u0648\u064E\u0646\u064E\u0630\u0650\u064A\u0631\u0657\u0627 \u0641\u064E\u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0646\u064E\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u0643\u0650\u0646\u0651\u064E\u0629\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u0650\u0646\u064E\u0627 \u0648\u064E\u0642\u06E1\u0631\u065E \u0648\u064E\u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650\u0646\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u0650\u0643\u064E \u062D\u0650\u062C\u064E\u0627\u0628\u065E \u0641\u064E\u0671\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0646\u064E\u0627 \u0639\u064E\u0670\u0645\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0628\u064E\u0634\u064E\u0631\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0643\u064F\u0645\u06E1 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u065E \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0647\u064F\u06D7 \u0648\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u062A\u064F\u0648\u0646\u064E \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0647\u064F\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064E\u0645\u06E1\u0646\u064F\u0648\u0646\u0656" }, { id: 9, text: "\u06DE\u0642\u064F\u0644\u06E1 \u0623\u064E\u0626\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0641\u0650\u064A \u064A\u064E\u0648\u06E1\u0645\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646\u062F\u064E\u0627\u062F\u0657\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0631\u064E\u0648\u064E\u0670\u0633\u0650\u064A\u064E \u0645\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u064E\u0627 \u0648\u064E\u0628\u064E\u0670\u0631\u064E\u0643\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0642\u064E\u062F\u0651\u064E\u0631\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0642\u06E1\u0648\u064E\u0670\u062A\u064E\u0647\u064E\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0657 \u0644\u0651\u0650\u0644\u0633\u0651\u064E\u0627\u0653\u0626\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0647\u0650\u064A\u064E \u062F\u064F\u062E\u064E\u0627\u0646\u065E \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0644\u0650\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0671\u0626\u06E1\u062A\u0650\u064A\u064E\u0627 \u0637\u064E\u0648\u06E1\u0639\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0643\u064E\u0631\u06E1\u0647\u0657\u0627 \u0642\u064E\u0627\u0644\u064E\u062A\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0637\u064E\u0627\u0653\u0626\u0650\u0639\u0650\u064A\u0646\u064E" }, { id: 12, text: "\u0641\u064E\u0642\u064E\u0636\u064E\u0649\u0670\u0647\u064F\u0646\u0651\u064E \u0633\u064E\u0628\u06E1\u0639\u064E \u0633\u064E\u0645\u064E\u0670\u0648\u064E\u0627\u062A\u0656 \u0641\u0650\u064A \u064A\u064E\u0648\u06E1\u0645\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u0649\u0670 \u0641\u0650\u064A \u0643\u064F\u0644\u0651\u0650 \u0633\u064E\u0645\u064E\u0627\u0653\u0621\u064D \u0623\u064E\u0645\u06E1\u0631\u064E\u0647\u064E\u0627\u06DA \u0648\u064E\u0632\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0628\u0650\u0645\u064E\u0635\u064E\u0670\u0628\u0650\u064A\u062D\u064E \u0648\u064E\u062D\u0650\u0641\u06E1\u0638\u0657\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062A\u064E\u0642\u06E1\u062F\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u0650" }, { id: 13, text: "\u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0641\u064E\u0642\u064F\u0644\u06E1 \u0623\u064E\u0646\u0630\u064E\u0631\u06E1\u062A\u064F\u0643\u064F\u0645\u06E1 \u0635\u064E\u0670\u0639\u0650\u0642\u064E\u0629\u0657 \u0645\u0651\u0650\u062B\u06E1\u0644\u064E \u0635\u064E\u0670\u0639\u0650\u0642\u064E\u0629\u0650 \u0639\u064E\u0627\u062F\u0656 \u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064E" }, { id: 14, text: "\u0625\u0650\u0630\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0644\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0657 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0639\u064E\u0627\u062F\u065E \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0645\u0650\u0646\u0651\u064E\u0627 \u0642\u064F\u0648\u0651\u064E\u0629\u064B\u06D6 \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064F\u0645\u06E1 \u0647\u064F\u0648\u064E \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0642\u064F\u0648\u0651\u064E\u0629\u0657\u06D6 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u064A\u064E\u062C\u06E1\u062D\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0641\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0631\u0650\u064A\u062D\u0657\u0627 \u0635\u064E\u0631\u06E1\u0635\u064E\u0631\u0657\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u0646\u0651\u064E\u062D\u0650\u0633\u064E\u0627\u062A\u0656 \u0644\u0651\u0650\u0646\u064F\u0630\u0650\u064A\u0642\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062E\u0650\u0632\u06E1\u064A\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0644\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0623\u064E\u062E\u06E1\u0632\u064E\u0649\u0670\u06D6 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u062B\u064E\u0645\u064F\u0648\u062F\u064F \u0641\u064E\u0647\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u062D\u064E\u0628\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0645\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0635\u064E\u0670\u0639\u0650\u0642\u064E\u0629\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u06E1\u0647\u064F\u0648\u0646\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F \u0623\u064E\u0639\u06E1\u062F\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0641\u064E\u0647\u064F\u0645\u06E1 \u064A\u064F\u0648\u0632\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0647\u064E\u0627 \u0634\u064E\u0647\u0650\u062F\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0633\u064E\u0645\u06E1\u0639\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u062C\u064F\u0644\u064F\u0648\u062F\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u062C\u064F\u0644\u064F\u0648\u062F\u0650\u0647\u0650\u0645\u06E1 \u0644\u0650\u0645\u064E \u0634\u064E\u0647\u0650\u062F\u062A\u0651\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0637\u064E\u0642\u064E\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0637\u064E\u0642\u064E \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u0651\u064E\u0644\u064E \u0645\u064E\u0631\u0651\u064E\u0629\u0656 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0633\u06E1\u062A\u064E\u062A\u0650\u0631\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0633\u064E\u0645\u06E1\u0639\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062C\u064F\u0644\u064F\u0648\u062F\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0638\u064E\u0646\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0638\u064E\u0646\u0651\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0638\u064E\u0646\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0631\u06E1\u062F\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 24, text: "\u0641\u064E\u0625\u0650\u0646 \u064A\u064E\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0645\u064E\u062B\u06E1\u0648\u0657\u0649 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062A\u0650\u0628\u064F\u0648\u0627\u0652 \u0641\u064E\u0645\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0639\u06E1\u062A\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 25, text: "\u06DE\u0648\u064E\u0642\u064E\u064A\u0651\u064E\u0636\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064F\u0631\u064E\u0646\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0632\u064E\u064A\u0651\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u06E1\u0641\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u062D\u064E\u0642\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0641\u0650\u064A\u0653 \u0623\u064F\u0645\u064E\u0645\u0656 \u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0627\u0652 \u0644\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0648\u064E\u0671\u0644\u06E1\u063A\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u063A\u06E1\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0641\u064E\u0644\u064E\u0646\u064F\u0630\u0650\u064A\u0642\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u0657\u0627 \u0648\u064E\u0644\u064E\u0646\u064E\u062C\u06E1\u0632\u0650\u064A\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0633\u06E1\u0648\u064E\u0623\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0623\u064E\u0639\u06E1\u062F\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F\u06D6 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062F\u064E\u0627\u0631\u064F \u0671\u0644\u06E1\u062E\u064F\u0644\u06E1\u062F\u0650 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064E\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u064A\u064E\u062C\u06E1\u062D\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0631\u0650\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u0636\u064E\u0644\u0651\u064E\u0627\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650 \u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1\u0647\u064F\u0645\u064E\u0627 \u062A\u064E\u062D\u06E1\u062A\u064E \u0623\u064E\u0642\u06E1\u062F\u064E\u0627\u0645\u0650\u0646\u064E\u0627 \u0644\u0650\u064A\u064E\u0643\u064F\u0648\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0641\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u0642\u064E\u0670\u0645\u064F\u0648\u0627\u0652 \u062A\u064E\u062A\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0628\u06E1\u0634\u0650\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650\u06D6 \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0627 \u062A\u064E\u0634\u06E1\u062A\u064E\u0647\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0627 \u062A\u064E\u062F\u0651\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u0646\u064F\u0632\u064F\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u063A\u064E\u0641\u064F\u0648\u0631\u0656 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0656" }, { id: 33, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u0645\u0651\u0650\u0645\u0651\u064E\u0646 \u062F\u064E\u0639\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u0633\u064E\u0646\u064E\u0629\u064F \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u064F\u06DA \u0671\u062F\u06E1\u0641\u064E\u0639\u06E1 \u0628\u0650\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0647\u0650\u064A\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064E \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0639\u064E\u062F\u064E\u0670\u0648\u064E\u0629\u065E \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u0650\u064A\u0651\u064C \u062D\u064E\u0645\u0650\u064A\u0645\u065E" }, { id: 35, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0644\u064E\u0642\u0651\u064E\u0649\u0670\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0644\u064E\u0642\u0651\u064E\u0649\u0670\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0630\u064F\u0648 \u062D\u064E\u0638\u0651\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 36, text: "\u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0646\u0632\u064E\u063A\u064E\u0646\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0646\u064E\u0632\u06E1\u063A\u065E \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0639\u0650\u0630\u06E1 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 37, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064F \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064F \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064F \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064F\u06DA \u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u0650 \u0648\u064E\u0644\u064E\u0627 \u0644\u0650\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u0650 \u0648\u064E\u0671\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652\u06E4 \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06E4 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u064A\u0651\u064E\u0627\u0647\u064F \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0641\u064E\u0625\u0650\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0645\u064F\u0648\u0646\u064E\u06E9" }, { id: 39, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u0651\u064E\u0643\u064E \u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u062E\u064E\u0670\u0634\u0650\u0639\u064E\u0629\u0657 \u0641\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064E \u0671\u0647\u06E1\u062A\u064E\u0632\u0651\u064E\u062A\u06E1 \u0648\u064E\u0631\u064E\u0628\u064E\u062A\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u062D\u06E1\u064A\u064E\u0627\u0647\u064E\u0627 \u0644\u064E\u0645\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 40, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0644\u06E1\u062D\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0644\u064E\u0627 \u064A\u064E\u062E\u06E1\u0641\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653\u06D7 \u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u064A\u064F\u0644\u06E1\u0642\u064E\u0649\u0670 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u062E\u064E\u064A\u06E1\u0631\u064C \u0623\u064E\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0653 \u0621\u064E\u0627\u0645\u0650\u0646\u0657\u0627 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06DA \u0671\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0634\u0650\u0626\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u064C" }, { id: 41, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650 \u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0643\u0650\u062A\u064E\u0670\u0628\u064C \u0639\u064E\u0632\u0650\u064A\u0632\u065E" }, { id: 42, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650 \u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650 \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0644\u064E\u0627 \u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u0650\u0647\u0650\u06E6\u06D6 \u062A\u064E\u0646\u0632\u0650\u064A\u0644\u065E \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u0643\u0650\u064A\u0645\u064D \u062D\u064E\u0645\u0650\u064A\u062F\u0656" }, { id: 43, text: "\u0645\u0651\u064E\u0627 \u064A\u064F\u0642\u064E\u0627\u0644\u064F \u0644\u064E\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0642\u064E\u062F\u06E1 \u0642\u0650\u064A\u0644\u064E \u0644\u0650\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u0650 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0630\u064F\u0648 \u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0656 \u0648\u064E\u0630\u064F\u0648 \u0639\u0650\u0642\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 44, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064B\u0627 \u0623\u064E\u0639\u06E1\u062C\u064E\u0645\u0650\u064A\u0651\u0657\u0627 \u0644\u0651\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0641\u064F\u0635\u0651\u0650\u0644\u064E\u062A\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0647\u064F\u06E5\u0653\u06D6 \u0621\u064E\u0627\u06EC\u0639\u06E1\u062C\u064E\u0645\u0650\u064A\u0651\u065E \u0648\u064E\u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u065E\u06D7 \u0642\u064F\u0644\u06E1 \u0647\u064F\u0648\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0634\u0650\u0641\u064E\u0627\u0653\u0621\u065E\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0642\u06E1\u0631\u065E \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0639\u064E\u0645\u064B\u0649\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u064A\u064F\u0646\u064E\u0627\u062F\u064E\u0648\u06E1\u0646\u064E \u0645\u0650\u0646 \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u0650\u06ED \u0628\u064E\u0639\u0650\u064A\u062F\u0656" }, { id: 45, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0641\u064E\u0671\u062E\u06E1\u062A\u064F\u0644\u0650\u0641\u064E \u0641\u0650\u064A\u0647\u0650\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u065E \u0633\u064E\u0628\u064E\u0642\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0645\u064F\u0631\u0650\u064A\u0628\u0656" }, { id: 46, text: "\u0645\u0651\u064E\u0646\u06E1 \u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0633\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06D7 \u0648\u064E\u0645\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0628\u0650\u0638\u064E\u0644\u0651\u064E\u0640\u0670\u0645\u0656 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0628\u0650\u064A\u062F\u0650" }, { id: 47, text: "\u06DE\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u064A\u064F\u0631\u064E\u062F\u0651\u064F \u0639\u0650\u0644\u06E1\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646 \u062B\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0643\u06E1\u0645\u064E\u0627\u0645\u0650\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F \u0645\u0650\u0646\u06E1 \u0623\u064F\u0646\u062B\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0636\u064E\u0639\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0639\u0650\u0644\u06E1\u0645\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0646\u064E\u0627\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064E\u064A\u06E1\u0646\u064E \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u0650\u064A \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0630\u064E\u0646\u0651\u064E\u0640\u0670\u0643\u064E \u0645\u064E\u0627\u0645\u0650\u0646\u0651\u064E\u0627 \u0645\u0650\u0646 \u0634\u064E\u0647\u0650\u064A\u062F\u0656" }, { id: 48, text: "\u0648\u064E\u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0648\u064E\u0638\u064E\u0646\u0651\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u062D\u0650\u064A\u0635\u0656" }, { id: 49, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0645\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0645\u0650\u0646 \u062F\u064F\u0639\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650 \u0648\u064E\u0625\u0650\u0646 \u0645\u0651\u064E\u0633\u0651\u064E\u0647\u064F \u0671\u0644\u0634\u0651\u064E\u0631\u0651\u064F \u0641\u064E\u064A\u064E\u0640\u0654\u064F\u0648\u0633\u065E \u0642\u064E\u0646\u064F\u0648\u0637\u065E" }, { id: 50, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064E\u0630\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0636\u064E\u0631\u0651\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0633\u0651\u064E\u062A\u06E1\u0647\u064F \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064E\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u0650\u064A \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0638\u064F\u0646\u0651\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0631\u0651\u064F\u062C\u0650\u0639\u06E1\u062A\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0625\u0650\u0646\u0651\u064E \u0644\u0650\u064A \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0644\u064E\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670\u06DA \u0641\u064E\u0644\u064E\u0646\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0646\u064F\u0630\u0650\u064A\u0642\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064D \u063A\u064E\u0644\u0650\u064A\u0638\u0656" }, { id: 51, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u0650 \u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064E \u0648\u064E\u0646\u064E\u0640\u0654\u064E\u0627 \u0628\u0650\u062C\u064E\u0627\u0646\u0650\u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E\u0647\u064F \u0671\u0644\u0634\u0651\u064E\u0631\u0651\u064F \u0641\u064E\u0630\u064F\u0648 \u062F\u064F\u0639\u064E\u0627\u0653\u0621\u064D \u0639\u064E\u0631\u0650\u064A\u0636\u0656" }, { id: 52, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u0643\u064E\u0641\u064E\u0631\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0634\u0650\u0642\u064E\u0627\u0642\u0650\u06ED \u0628\u064E\u0639\u0650\u064A\u062F\u0656" }, { id: 53, text: "\u0633\u064E\u0646\u064F\u0631\u0650\u064A\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u0641\u064E\u0627\u0642\u0650 \u0648\u064E\u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06D7 \u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u06E1\u0641\u0650 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u064C" }, { id: 54, text: "\u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0645\u0650\u0631\u06E1\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0644\u0651\u0650\u0642\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u064F\u062D\u0650\u064A\u0637\u064F\u06E2" }] }, { id: 42, name: "\u0627\u0644\u0634\u0648\u0631\u0649", transliteration: "Ash-Shuraa", type: "meccan", total_verses: 53, verses: [{ id: 1, text: "\u062D\u0645\u0653" }, { id: 2, text: "\u0639\u0653\u0633\u0653\u0642\u0653" }, { id: 3, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0648\u062D\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 4, text: "\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 5, text: "\u062A\u064E\u0643\u064E\u0627\u062F\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u064F \u064A\u064E\u062A\u064E\u0641\u064E\u0637\u0651\u064E\u0631\u06E1\u0646\u064E \u0645\u0650\u0646 \u0641\u064E\u0648\u06E1\u0642\u0650\u0647\u0650\u0646\u0651\u064E\u06DA \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0646\u064E \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0644\u0650\u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 6, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062D\u064E\u0641\u0650\u064A\u0638\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0648\u064E\u0643\u0650\u064A\u0644\u0656" }, { id: 7, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064B\u0627 \u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u0657\u0627 \u0644\u0651\u0650\u062A\u064F\u0646\u0630\u0650\u0631\u064E \u0623\u064F\u0645\u0651\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0646\u06E1 \u062D\u064E\u0648\u06E1\u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u062A\u064F\u0646\u0630\u0650\u0631\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u062C\u064E\u0645\u06E1\u0639\u0650 \u0644\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u0650\u06DA \u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0648\u064E\u0641\u064E\u0631\u0650\u064A\u0642\u065E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0639\u0650\u064A\u0631\u0650" }, { id: 8, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u064D" }, { id: 9, text: "\u0623\u064E\u0645\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E\u06D6 \u0641\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0648\u064E\u0644\u0650\u064A\u0651\u064F \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670 \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 10, text: "\u0648\u064E\u0645\u064E\u0627 \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u062D\u064F\u0643\u06E1\u0645\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u0650\u064A \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u062A\u064F \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064F\u0646\u0650\u064A\u0628\u064F" }, { id: 11, text: "\u0641\u064E\u0627\u0637\u0650\u0631\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u064A\u064E\u0630\u06E1\u0631\u064E\u0624\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650\u06DA \u0644\u064E\u064A\u06E1\u0633\u064E \u0643\u064E\u0645\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0634\u064E\u064A\u06E1\u0621\u065E\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0628\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 12, text: "\u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0642\u064E\u0627\u0644\u0650\u064A\u062F\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 13, text: "\u06DE\u0634\u064E\u0631\u064E\u0639\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0645\u064E\u0627 \u0648\u064E\u0635\u0651\u064E\u0649\u0670 \u0628\u0650\u0647\u0650\u06E6 \u0646\u064F\u0648\u062D\u0657\u0627 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0645\u064E\u0627 \u0648\u064E\u0635\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0648\u064E\u0639\u0650\u064A\u0633\u064E\u0649\u0670\u0653\u06D6 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u064E\u0641\u064E\u0631\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650\u06DA \u0643\u064E\u0628\u064F\u0631\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0645\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062C\u06E1\u062A\u064E\u0628\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u064E\u0646 \u064A\u064F\u0646\u0650\u064A\u0628\u064F" }, { id: 14, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0641\u064E\u0631\u0651\u064E\u0642\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064F \u0628\u064E\u063A\u06E1\u064A\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u065E \u0633\u064E\u0628\u064E\u0642\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649 \u0644\u0651\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u0631\u0650\u062B\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0645\u064F\u0631\u0650\u064A\u0628\u0656" }, { id: 15, text: "\u0641\u064E\u0644\u0650\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0671\u062F\u06E1\u0639\u064F\u06D6 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0642\u0650\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0642\u064F\u0644\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u062A\u064F \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0643\u0650\u062A\u064E\u0670\u0628\u0656\u06D6 \u0648\u064E\u0623\u064F\u0645\u0650\u0631\u06E1\u062A\u064F \u0644\u0650\u0623\u064E\u0639\u06E1\u062F\u0650\u0644\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u064F\u06D6 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0644\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0643\u064F\u0645\u06E1\u06D6 \u0644\u064E\u0627 \u062D\u064F\u062C\u0651\u064E\u0629\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u064F\u06D6 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062C\u06E1\u0645\u064E\u0639\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 16, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062D\u064E\u0627\u0653\u062C\u0651\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064F\u062C\u0650\u064A\u0628\u064E \u0644\u064E\u0647\u064F\u06E5 \u062D\u064F\u062C\u0651\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u062F\u064E\u0627\u062D\u0650\u0636\u064E\u0629\u064C \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u063A\u064E\u0636\u064E\u0628\u065E \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u064C" }, { id: 17, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u0650\u064A\u0632\u064E\u0627\u0646\u064E\u06D7 \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u062F\u06E1\u0631\u0650\u064A\u0643\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0642\u064E\u0631\u0650\u064A\u0628\u065E" }, { id: 18, text: "\u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F \u0628\u0650\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u064E\u0627\u06D6 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0634\u06E1\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0645\u064E\u0627\u0631\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650 \u0644\u064E\u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0650\u06ED \u0628\u064E\u0639\u0650\u064A\u062F\u064D" }, { id: 19, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0637\u0650\u064A\u0641\u064F\u06E2 \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F" }, { id: 20, text: "\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u062D\u064E\u0631\u06E1\u062B\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0646\u064E\u0632\u0650\u062F\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u062D\u064E\u0631\u06E1\u062B\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u062D\u064E\u0631\u06E1\u062B\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0646\u064F\u0624\u06E1\u062A\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0645\u0650\u0646 \u0646\u0651\u064E\u0635\u0650\u064A\u0628\u064D" }, { id: 21, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0634\u064F\u0631\u064E\u0643\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0634\u064E\u0631\u064E\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u0630\u064E\u0646\u06E2 \u0628\u0650\u0647\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064F \u0671\u0644\u06E1\u0641\u064E\u0635\u06E1\u0644\u0650 \u0644\u064E\u0642\u064F\u0636\u0650\u064A\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 22, text: "\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0645\u064F\u0634\u06E1\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u0648\u064E \u0648\u064E\u0627\u0642\u0650\u0639\u064F\u06E2 \u0628\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0641\u0650\u064A \u0631\u064E\u0648\u06E1\u0636\u064E\u0627\u062A\u0650 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0627\u062A\u0650\u06D6 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u0648\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u06E1\u0643\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 23, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650\u06D7 \u0642\u064F\u0644 \u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0648\u064E\u062F\u0651\u064E\u0629\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0642\u06E1\u062A\u064E\u0631\u0650\u0641\u06E1 \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u0657 \u0646\u0651\u064E\u0632\u0650\u062F\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A\u0647\u064E\u0627 \u062D\u064F\u0633\u06E1\u0646\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0634\u064E\u0643\u064F\u0648\u0631\u064C" }, { id: 24, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u0657\u0627\u06D6 \u0641\u064E\u0625\u0650\u0646 \u064A\u064E\u0634\u064E\u0625\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u062E\u06E1\u062A\u0650\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0644\u06E1\u0628\u0650\u0643\u064E\u06D7 \u0648\u064E\u064A\u064E\u0645\u06E1\u062D\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u064E \u0648\u064E\u064A\u064F\u062D\u0650\u0642\u0651\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0628\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 25, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0642\u06E1\u0628\u064E\u0644\u064F \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0628\u064E\u0629\u064E \u0639\u064E\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u0639\u06E1\u0641\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0648\u064E\u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0648\u064E\u064A\u064E\u0632\u0650\u064A\u062F\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u065E" }, { id: 27, text: "\u06DE\u0648\u064E\u0644\u064E\u0648\u06E1 \u0628\u064E\u0633\u064E\u0637\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0631\u0651\u0650\u0632\u06E1\u0642\u064E \u0644\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u0644\u064E\u0628\u064E\u063A\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0628\u0650\u0642\u064E\u062F\u064E\u0631\u0656 \u0645\u0651\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 28, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u062B\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u0642\u064E\u0646\u064E\u0637\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u0646\u0634\u064F\u0631\u064F \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0648\u064E\u0644\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u062F\u064F" }, { id: 29, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u062E\u064E\u0644\u06E1\u0642\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u062B\u0651\u064E \u0641\u0650\u064A\u0647\u0650\u0645\u064E\u0627 \u0645\u0650\u0646 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u0656\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u062C\u064E\u0645\u06E1\u0639\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 30, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0670\u0628\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064F\u0635\u0650\u064A\u0628\u064E\u0629\u0656 \u0641\u064E\u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0639\u06E1\u0641\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0643\u064E\u062B\u0650\u064A\u0631\u0656" }, { id: 31, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u0656" }, { id: 32, text: "\u0648\u064E\u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650 \u0671\u0644\u06E1\u062C\u064E\u0648\u064E\u0627\u0631\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0643\u064E\u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0670\u0645\u0650" }, { id: 33, text: "\u0625\u0650\u0646 \u064A\u064E\u0634\u064E\u0623\u06E1 \u064A\u064F\u0633\u06E1\u0643\u0650\u0646\u0650 \u0671\u0644\u0631\u0651\u0650\u064A\u062D\u064E \u0641\u064E\u064A\u064E\u0638\u06E1\u0644\u064E\u0644\u06E1\u0646\u064E \u0631\u064E\u0648\u064E\u0627\u0643\u0650\u062F\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0638\u064E\u0647\u06E1\u0631\u0650\u0647\u0650\u06E6\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0635\u064E\u0628\u0651\u064E\u0627\u0631\u0656 \u0634\u064E\u0643\u064F\u0648\u0631\u064D" }, { id: 34, text: "\u0623\u064E\u0648\u06E1 \u064A\u064F\u0648\u0628\u0650\u0642\u06E1\u0647\u064F\u0646\u0651\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u0639\u06E1\u0641\u064F \u0639\u064E\u0646 \u0643\u064E\u062B\u0650\u064A\u0631\u0656" }, { id: 35, text: "\u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u062D\u0650\u064A\u0635\u0656" }, { id: 36, text: "\u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u0650\u064A\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0645\u064E\u062A\u064E\u0670\u0639\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E \u0648\u064E\u0623\u064E\u0628\u06E1\u0642\u064E\u0649\u0670 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062C\u06E1\u062A\u064E\u0646\u0650\u0628\u064F\u0648\u0646\u064E \u0643\u064E\u0628\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u064E \u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u0641\u064E\u0648\u064E\u0670\u062D\u0650\u0634\u064E \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627 \u063A\u064E\u0636\u0650\u0628\u064F\u0648\u0627\u0652 \u0647\u064F\u0645\u06E1 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0633\u06E1\u062A\u064E\u062C\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0642\u064E\u0627\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0623\u064E\u0645\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0634\u064F\u0648\u0631\u064E\u0649\u0670 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u063A\u06E1\u064A\u064F \u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u062A\u064E\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0648\u064E\u062C\u064E\u0632\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u0656 \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064F\u0647\u064E\u0627\u06D6 \u0641\u064E\u0645\u064E\u0646\u06E1 \u0639\u064E\u0641\u064E\u0627 \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064E \u0641\u064E\u0623\u064E\u062C\u06E1\u0631\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0648\u064E\u0644\u064E\u0645\u064E\u0646\u0650 \u0671\u0646\u062A\u064E\u0635\u064E\u0631\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0638\u064F\u0644\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u064D" }, { id: 42, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0638\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0648\u064E\u064A\u064E\u0628\u06E1\u063A\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 43, text: "\u0648\u064E\u0644\u064E\u0645\u064E\u0646 \u0635\u064E\u0628\u064E\u0631\u064E \u0648\u064E\u063A\u064E\u0641\u064E\u0631\u064E \u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0645\u0650\u0646\u06E1 \u0639\u064E\u0632\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u0650" }, { id: 44, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0648\u064E\u0644\u0650\u064A\u0651\u0656 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u06E6\u06D7 \u0648\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0647\u064E\u0644\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0631\u064E\u062F\u0651\u0656 \u0645\u0651\u0650\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0656" }, { id: 45, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u064A\u064F\u0639\u06E1\u0631\u064E\u0636\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u062E\u064E\u0670\u0634\u0650\u0639\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0630\u0651\u064F\u0644\u0651\u0650 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0637\u064E\u0631\u06E1\u0641\u064D \u062E\u064E\u0641\u0650\u064A\u0651\u0656\u06D7 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062E\u064E\u0633\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u0650\u064A\u0647\u0650\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0639\u064E\u0630\u064E\u0627\u0628\u0656 \u0645\u0651\u064F\u0642\u0650\u064A\u0645\u0656" }, { id: 46, text: "\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0648\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0636\u06E1\u0644\u0650\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u064D" }, { id: 47, text: "\u0671\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u064A\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u0645\u064E\u0631\u064E\u062F\u0651\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0644\u06E1\u062C\u064E\u0625\u0656 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0643\u0650\u064A\u0631\u0656" }, { id: 48, text: "\u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062D\u064E\u0641\u0650\u064A\u0638\u064B\u0627\u06D6 \u0625\u0650\u0646\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F\u06D7 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0630\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0645\u0650\u0646\u0651\u064E\u0627 \u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0641\u064E\u0631\u0650\u062D\u064E \u0628\u0650\u0647\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0635\u0650\u0628\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0626\u064E\u0629\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0643\u064E\u0641\u064F\u0648\u0631\u065E" }, { id: 49, text: "\u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u064A\u064E\u0647\u064E\u0628\u064F \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0625\u0650\u0646\u064E\u0670\u062B\u0657\u0627 \u0648\u064E\u064A\u064E\u0647\u064E\u0628\u064F \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u0630\u0651\u064F\u0643\u064F\u0648\u0631\u064E" }, { id: 50, text: "\u0623\u064E\u0648\u06E1 \u064A\u064F\u0632\u064E\u0648\u0651\u0650\u062C\u064F\u0647\u064F\u0645\u06E1 \u0630\u064F\u0643\u06E1\u0631\u064E\u0627\u0646\u0657\u0627 \u0648\u064E\u0625\u0650\u0646\u064E\u0670\u062B\u0657\u0627\u06D6 \u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0639\u064E\u0642\u0650\u064A\u0645\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u0650\u064A\u0645\u065E \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 51, text: "\u06DE\u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0628\u064E\u0634\u064E\u0631\u064D \u0623\u064E\u0646 \u064A\u064F\u0643\u064E\u0644\u0651\u0650\u0645\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u062D\u06E1\u064A\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u064A\u0655\u0650 \u062D\u0650\u062C\u064E\u0627\u0628\u064D \u0623\u064E\u0648\u06E1 \u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0641\u064E\u064A\u064F\u0648\u062D\u0650\u064A\u064E \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u0650\u064A\u0651\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 52, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0648\u06E1\u062D\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0631\u064F\u0648\u062D\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u0646\u064E\u0627\u06DA \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u062A\u064E\u062F\u06E1\u0631\u0650\u064A \u0645\u064E\u0627 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064F \u0648\u064E\u0644\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064F \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0646\u064F\u0648\u0631\u0657\u0627 \u0646\u0651\u064E\u0647\u06E1\u062F\u0650\u064A \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u0646\u0651\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u062A\u064E\u0647\u06E1\u062F\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 53, text: "\u0635\u0650\u0631\u064E\u0670\u0637\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D7 \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0635\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u064F" }] }, { id: 43, name: "\u0627\u0644\u0632\u062E\u0631\u0641", transliteration: "Az-Zukhruf", type: "meccan", total_verses: 89, verses: [{ id: 1, text: "\u062D\u0645\u0653" }, { id: 2, text: "\u0648\u064E\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u0650" }, { id: 3, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0642\u064F\u0631\u06E1\u0621\u064E\u0670\u0646\u064B\u0627 \u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A\u0653 \u0623\u064F\u0645\u0651\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627 \u0644\u064E\u0639\u064E\u0644\u0650\u064A\u0651\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u064C" }, { id: 5, text: "\u0623\u064E\u0641\u064E\u0646\u064E\u0636\u06E1\u0631\u0650\u0628\u064F \u0639\u064E\u0646\u0643\u064F\u0645\u064F \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E \u0635\u064E\u0641\u06E1\u062D\u064B\u0627 \u0623\u064E\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0645\u0651\u064F\u0633\u06E1\u0631\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 6, text: "\u0648\u064E\u0643\u064E\u0645\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u0641\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0634\u064E\u062F\u0651\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0628\u064E\u0637\u06E1\u0634\u0657\u0627 \u0648\u064E\u0645\u064E\u0636\u064E\u0649\u0670 \u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0646\u0651\u064E \u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064F\u0646\u0651\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 10, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0645\u064E\u0647\u06E1\u062F\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0633\u064F\u0628\u064F\u0644\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u064E\u06E2 \u0628\u0650\u0642\u064E\u062F\u064E\u0631\u0656 \u0641\u064E\u0623\u064E\u0646\u0634\u064E\u0631\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0628\u064E\u0644\u06E1\u062F\u064E\u0629\u0657 \u0645\u0651\u064E\u064A\u06E1\u062A\u0657\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062A\u064F\u062E\u06E1\u0631\u064E\u062C\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064E \u0643\u064F\u0644\u0651\u064E\u0647\u064E\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650 \u0645\u064E\u0627 \u062A\u064E\u0631\u06E1\u0643\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0644\u0650\u062A\u064E\u0633\u06E1\u062A\u064E\u0648\u064F\u06E5\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0638\u064F\u0647\u064F\u0648\u0631\u0650\u0647\u0650\u06E6 \u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0644\u064E\u0646\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0642\u06E1\u0631\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0644\u064E\u0645\u064F\u0646\u0642\u064E\u0644\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0647\u0650\u06E6 \u062C\u064F\u0632\u06E1\u0621\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0644\u064E\u0643\u064E\u0641\u064F\u0648\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 16, text: "\u0623\u064E\u0645\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F \u0628\u064E\u0646\u064E\u0627\u062A\u0656 \u0648\u064E\u0623\u064E\u0635\u06E1\u0641\u064E\u0649\u0670\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0646\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0628\u064F\u0634\u0651\u0650\u0631\u064E \u0623\u064E\u062D\u064E\u062F\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0636\u064E\u0631\u064E\u0628\u064E \u0644\u0650\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0638\u064E\u0644\u0651\u064E \u0648\u064E\u062C\u06E1\u0647\u064F\u0647\u064F\u06E5 \u0645\u064F\u0633\u06E1\u0648\u064E\u062F\u0651\u0657\u0627 \u0648\u064E\u0647\u064F\u0648\u064E \u0643\u064E\u0638\u0650\u064A\u0645\u064C" }, { id: 18, text: "\u0623\u064E\u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0646\u064E\u0634\u0651\u064E\u0624\u064F\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u0650\u0644\u06E1\u064A\u064E\u0629\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u0650\u0635\u064E\u0627\u0645\u0650 \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 19, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0639\u0650\u0628\u064E\u0670\u062F\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0625\u0650\u0646\u064E\u0670\u062B\u064B\u0627\u06DA \u0623\u064E\u0634\u064E\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u062E\u064E\u0644\u06E1\u0642\u064E\u0647\u064F\u0645\u06E1\u06DA \u0633\u064E\u062A\u064F\u0643\u06E1\u062A\u064E\u0628\u064F \u0634\u064E\u0647\u064E\u0670\u062F\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0645\u064E\u0627 \u0639\u064E\u0628\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06D7 \u0645\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0644\u06E1\u0645\u064D\u06D6 \u0625\u0650\u0646\u06E1 \u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u064A\u064E\u062E\u06E1\u0631\u064F\u0635\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0623\u064E\u0645\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u064F\u0633\u06E1\u062A\u064E\u0645\u06E1\u0633\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0628\u064E\u0644\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062B\u064E\u0670\u0631\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0648\u064E\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0641\u0650\u064A \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0630\u0650\u064A\u0631\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0645\u064F\u062A\u06E1\u0631\u064E\u0641\u064F\u0648\u0647\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062B\u064E\u0670\u0631\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u0642\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u06DE\u0642\u064E\u0670\u0644\u064E \u0623\u064E\u0648\u064E\u0644\u064E\u0648\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064F\u0643\u064F\u0645 \u0628\u0650\u0623\u064E\u0647\u06E1\u062F\u064E\u0649\u0670 \u0645\u0650\u0645\u0651\u064E\u0627 \u0648\u064E\u062C\u064E\u062F\u062A\u0651\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0641\u064E\u0671\u0646\u062A\u064E\u0642\u064E\u0645\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0671\u0646\u0638\u064F\u0631\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064F \u0644\u0650\u0623\u064E\u0628\u0650\u064A\u0647\u0650 \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646\u0651\u064E\u0646\u0650\u064A \u0628\u064E\u0631\u064E\u0627\u0653\u0621\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u064E\u0637\u064E\u0631\u064E\u0646\u0650\u064A \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0633\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0646\u0650" }, { id: 28, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064E\u0627 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064E\u06E2 \u0628\u064E\u0627\u0642\u0650\u064A\u064E\u0629\u0657 \u0641\u0650\u064A \u0639\u064E\u0642\u0650\u0628\u0650\u0647\u0650\u06E6 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0628\u064E\u0644\u06E1 \u0645\u064E\u062A\u0651\u064E\u0639\u06E1\u062A\u064F \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 30, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0646\u064F\u0632\u0651\u0650\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u062C\u064F\u0644\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0631\u06E1\u064A\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u0639\u064E\u0638\u0650\u064A\u0645\u064D" }, { id: 32, text: "\u0623\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0642\u06E1\u0633\u0650\u0645\u064F\u0648\u0646\u064E \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E\u06DA \u0646\u064E\u062D\u06E1\u0646\u064F \u0642\u064E\u0633\u064E\u0645\u06E1\u0646\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0639\u0650\u064A\u0634\u064E\u062A\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06DA \u0648\u064E\u0631\u064E\u0641\u064E\u0639\u06E1\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0648\u06E1\u0642\u064E \u0628\u064E\u0639\u06E1\u0636\u0656 \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u064A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u0657\u0627 \u0633\u064F\u062E\u06E1\u0631\u0650\u064A\u0651\u0657\u0627\u06D7 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0623\u064F\u0645\u0651\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0644\u0651\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F \u0628\u0650\u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0644\u0650\u0628\u064F\u064A\u064F\u0648\u062A\u0650\u0647\u0650\u0645\u06E1 \u0633\u064F\u0642\u064F\u0641\u0657\u0627 \u0645\u0651\u0650\u0646 \u0641\u0650\u0636\u0651\u064E\u0629\u0656 \u0648\u064E\u0645\u064E\u0639\u064E\u0627\u0631\u0650\u062C\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u064A\u064E\u0638\u06E1\u0647\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0644\u0650\u0628\u064F\u064A\u064F\u0648\u062A\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u0657\u0627 \u0648\u064E\u0633\u064F\u0631\u064F\u0631\u064B\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u064A\u064E\u062A\u0651\u064E\u0643\u0650\u0640\u0654\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0648\u064E\u0632\u064F\u062E\u06E1\u0631\u064F\u0641\u0657\u0627\u06DA \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0644\u0651\u064F \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u062A\u064E\u0670\u0639\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u0650 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06DA \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064F \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 36, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0634\u064F \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0646\u064F\u0642\u064E\u064A\u0651\u0650\u0636\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0634\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0657\u0627 \u0641\u064E\u0647\u064F\u0648\u064E \u0644\u064E\u0647\u064F\u06E5 \u0642\u064E\u0631\u0650\u064A\u0646\u065E" }, { id: 37, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650 \u0648\u064E\u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064E \u0628\u064F\u0639\u06E1\u062F\u064E \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0631\u0650\u0642\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0642\u064E\u0631\u0650\u064A\u0646\u064F" }, { id: 39, text: "\u0648\u064E\u0644\u064E\u0646 \u064A\u064E\u0646\u0641\u064E\u0639\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0625\u0650\u0630 \u0638\u0651\u064E\u0644\u064E\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0645\u064F\u0634\u06E1\u062A\u064E\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0623\u064E\u0641\u064E\u0623\u064E\u0646\u062A\u064E \u062A\u064F\u0633\u06E1\u0645\u0650\u0639\u064F \u0671\u0644\u0635\u0651\u064F\u0645\u0651\u064E \u0623\u064E\u0648\u06E1 \u062A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0639\u064F\u0645\u06E1\u064A\u064E \u0648\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 41, text: "\u0641\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u0646\u064E\u0630\u06E1\u0647\u064E\u0628\u064E\u0646\u0651\u064E \u0628\u0650\u0643\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064F\u0646\u062A\u064E\u0642\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0623\u064E\u0648\u06E1 \u0646\u064F\u0631\u0650\u064A\u064E\u0646\u0651\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0648\u064E\u0639\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064F\u0642\u06E1\u062A\u064E\u062F\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0645\u06E1\u0633\u0650\u0643\u06E1 \u0628\u0650\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 44, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0630\u0650\u0643\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064E \u0648\u064E\u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0643\u064E\u06D6 \u0648\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u06E1 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0643\u064E \u0645\u0650\u0646 \u0631\u0651\u064F\u0633\u064F\u0644\u0650\u0646\u064E\u0627\u0653 \u0623\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u0657 \u064A\u064F\u0639\u06E1\u0628\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0645\u064E\u0644\u064E\u0625\u0650\u064A\u0652\u0647\u0650\u06E6 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0631\u064E\u0633\u064F\u0648\u0644\u064F \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u064A\u064E\u0636\u06E1\u062D\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0645\u064E\u0627 \u0646\u064F\u0631\u0650\u064A\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u0650\u064A\u064E \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F \u0645\u0650\u0646\u06E1 \u0623\u064F\u062E\u06E1\u062A\u0650\u0647\u064E\u0627\u06D6 \u0648\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E \u0671\u0644\u0633\u0651\u064E\u0627\u062D\u0650\u0631\u064F \u0671\u062F\u06E1\u0639\u064F \u0644\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0647\u0650\u062F\u064E \u0639\u0650\u0646\u062F\u064E\u0643\u064E \u0625\u0650\u0646\u0651\u064E\u0646\u064E\u0627 \u0644\u064E\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0634\u064E\u0641\u06E1\u0646\u064E\u0627 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u0643\u064F\u062B\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0648\u064E\u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0641\u0650\u064A \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u0650\u064A \u0645\u064F\u0644\u06E1\u0643\u064F \u0645\u0650\u0635\u06E1\u0631\u064E \u0648\u064E\u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u064A\u0653\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0623\u064E\u0645\u06E1 \u0623\u064E\u0646\u064E\u0627\u06E0 \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0647\u064F\u0648\u064E \u0645\u064E\u0647\u0650\u064A\u0646\u065E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0643\u064E\u0627\u062F\u064F \u064A\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 53, text: "\u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064F\u0644\u06E1\u0642\u0650\u064A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u0633\u06E1\u0648\u0650\u0631\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0630\u064E\u0647\u064E\u0628\u064D \u0623\u064E\u0648\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0639\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0645\u064F\u0642\u06E1\u062A\u064E\u0631\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u062E\u064E\u0641\u0651\u064E \u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u06E5 \u0641\u064E\u0623\u064E\u0637\u064E\u0627\u0639\u064F\u0648\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 55, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u0633\u064E\u0641\u064F\u0648\u0646\u064E\u0627 \u0671\u0646\u062A\u064E\u0642\u064E\u0645\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u063A\u06E1\u0631\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 56, text: "\u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0633\u064E\u0644\u064E\u0641\u0657\u0627 \u0648\u064E\u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 57, text: "\u06DE\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0636\u064F\u0631\u0650\u0628\u064E \u0671\u0628\u06E1\u0646\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0645\u064E\u062B\u064E\u0644\u064B\u0627 \u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u064F\u0643\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u064A\u064E\u0635\u0650\u062F\u0651\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0623\u064E\u0670\u0644\u0650\u0647\u064E\u062A\u064F\u0646\u064E\u0627 \u062E\u064E\u064A\u06E1\u0631\u064C \u0623\u064E\u0645\u06E1 \u0647\u064F\u0648\u064E\u06DA \u0645\u064E\u0627 \u0636\u064E\u0631\u064E\u0628\u064F\u0648\u0647\u064F \u0644\u064E\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u062C\u064E\u062F\u064E\u0644\u064E\u06E2\u0627\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064C \u062E\u064E\u0635\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0628\u06E1\u062F\u064C \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0644\u0651\u0650\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E" }, { id: 60, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0644\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0657 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u064A\u064E\u062E\u06E1\u0644\u064F\u0641\u064F\u0648\u0646\u064E" }, { id: 61, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0639\u0650\u0644\u06E1\u0645\u065E \u0644\u0651\u0650\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u06E1\u062A\u064E\u0631\u064F\u0646\u0651\u064E \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u0650\u06DA \u0647\u064E\u0670\u0630\u064E\u0627 \u0635\u0650\u0631\u064E\u0670\u0637\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u065E" }, { id: 62, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0635\u064F\u062F\u0651\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 63, text: "\u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0639\u0650\u064A\u0633\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0642\u064E\u0627\u0644\u064E \u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u062A\u064F\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u0650 \u0648\u064E\u0644\u0650\u0623\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E \u0644\u064E\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u0650\u06D6 \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 64, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0647\u064F\u06DA \u0647\u064E\u0670\u0630\u064E\u0627 \u0635\u0650\u0631\u064E\u0670\u0637\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u065E" }, { id: 65, text: "\u0641\u064E\u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064E \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0632\u064E\u0627\u0628\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0641\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u064A\u064E\u0648\u06E1\u0645\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u064D" }, { id: 66, text: "\u0647\u064E\u0644\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645 \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u0671\u0644\u06E1\u0623\u064E\u062E\u0650\u0644\u0651\u064E\u0627\u0653\u0621\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0650\u06ED \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0644\u0650\u0628\u064E\u0639\u06E1\u0636\u064D \u0639\u064E\u062F\u064F\u0648\u0651\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 68, text: "\u064A\u064E\u0670\u0639\u0650\u0628\u064E\u0627\u062F\u0650 \u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 70, text: "\u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064F\u0643\u064F\u0645\u06E1 \u062A\u064F\u062D\u06E1\u0628\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u064A\u064F\u0637\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0635\u0650\u062D\u064E\u0627\u0641\u0656 \u0645\u0651\u0650\u0646 \u0630\u064E\u0647\u064E\u0628\u0656 \u0648\u064E\u0623\u064E\u0643\u06E1\u0648\u064E\u0627\u0628\u0656\u06D6 \u0648\u064E\u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u064E\u0627 \u062A\u064E\u0634\u06E1\u062A\u064E\u0647\u0650\u064A\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0646\u0641\u064F\u0633\u064F \u0648\u064E\u062A\u064E\u0644\u064E\u0630\u0651\u064F \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u064F\u06D6 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064F\u0648\u0631\u0650\u062B\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u065E \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 74, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 75, text: "\u0644\u064E\u0627 \u064A\u064F\u0641\u064E\u062A\u0651\u064E\u0631\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0645\u064F\u0628\u06E1\u0644\u0650\u0633\u064F\u0648\u0646\u064E" }, { id: 76, text: "\u0648\u064E\u0645\u064E\u0627 \u0638\u064E\u0644\u064E\u0645\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0647\u064F\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 77, text: "\u0648\u064E\u0646\u064E\u0627\u062F\u064E\u0648\u06E1\u0627\u0652 \u064A\u064E\u0670\u0645\u064E\u0670\u0644\u0650\u0643\u064F \u0644\u0650\u064A\u064E\u0642\u06E1\u0636\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064F\u0643\u064E\u06D6 \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0640\u0670\u0643\u0650\u062B\u064F\u0648\u0646\u064E" }, { id: 78, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u0650\u0626\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0643\u064F\u0645\u06E1 \u0644\u0650\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0643\u064E\u0670\u0631\u0650\u0647\u064F\u0648\u0646\u064E" }, { id: 79, text: "\u0623\u064E\u0645\u06E1 \u0623\u064E\u0628\u06E1\u0631\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u0631\u0657\u0627 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064F\u0628\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 80, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0627 \u0644\u064E\u0627 \u0646\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u0633\u0650\u0631\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0646\u064E\u062C\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06DA \u0628\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u064F\u0646\u064E\u0627 \u0644\u064E\u062F\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u064A\u064E\u0643\u06E1\u062A\u064F\u0628\u064F\u0648\u0646\u064E" }, { id: 81, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0648\u064E\u0644\u064E\u062F\u065E \u0641\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0623\u064E\u0648\u0651\u064E\u0644\u064F \u0671\u0644\u06E1\u0639\u064E\u0670\u0628\u0650\u062F\u0650\u064A\u0646\u064E" }, { id: 82, text: "\u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0635\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0641\u064E\u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u062E\u064F\u0648\u0636\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u0644\u06E1\u0639\u064E\u0628\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0644\u064E\u0670\u0642\u064F\u0648\u0627\u0652 \u064A\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 84, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u065E \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u065E\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 85, text: "\u0648\u064E\u062A\u064E\u0628\u064E\u0627\u0631\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0648\u064E\u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0639\u0650\u0644\u06E1\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 86, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650 \u0671\u0644\u0634\u0651\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0634\u064E\u0647\u0650\u062F\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 87, text: "\u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0633\u064E\u0623\u064E\u0644\u06E1\u062A\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 88, text: "\u0648\u064E\u0642\u0650\u064A\u0644\u0650\u0647\u0650\u06E6 \u064A\u064E\u0670\u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0642\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 89, text: "\u0641\u064E\u0671\u0635\u06E1\u0641\u064E\u062D\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0642\u064F\u0644\u06E1 \u0633\u064E\u0644\u064E\u0670\u0645\u065E\u06DA \u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }] }, { id: 44, name: "\u0627\u0644\u062F\u062E\u0627\u0646", transliteration: "Ad-Dukhan", type: "meccan", total_verses: 59, verses: [{ id: 1, text: "\u062D\u0645\u0653" }, { id: 2, text: "\u0648\u064E\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u0650" }, { id: 3, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0641\u0650\u064A \u0644\u064E\u064A\u06E1\u0644\u064E\u0629\u0656 \u0645\u0651\u064F\u0628\u064E\u0670\u0631\u064E\u0643\u064E\u0629\u064D\u06DA \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064F\u0646\u0630\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 4, text: "\u0641\u0650\u064A\u0647\u064E\u0627 \u064A\u064F\u0641\u06E1\u0631\u064E\u0642\u064F \u0643\u064F\u0644\u0651\u064F \u0623\u064E\u0645\u06E1\u0631\u064D \u062D\u064E\u0643\u0650\u064A\u0645\u064D" }, { id: 5, text: "\u0623\u064E\u0645\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0646\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u064F\u0631\u06E1\u0633\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 6, text: "\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u0650\u064A\u0639\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 7, text: "\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0648\u0642\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u064A\u064F\u0645\u0650\u064A\u062A\u064F\u06D6 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0628\u0651\u064F \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0634\u064E\u0643\u0651\u0656 \u064A\u064E\u0644\u06E1\u0639\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0641\u064E\u0671\u0631\u06E1\u062A\u064E\u0642\u0650\u0628\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0623\u06E1\u062A\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0628\u0650\u062F\u064F\u062E\u064E\u0627\u0646\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 11, text: "\u064A\u064E\u063A\u06E1\u0634\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E\u06D6 \u0647\u064E\u0670\u0630\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 12, text: "\u0631\u0651\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0671\u0643\u06E1\u0634\u0650\u0641\u06E1 \u0639\u064E\u0646\u0651\u064E\u0627 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0648\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 14, text: "\u062B\u064F\u0645\u0651\u064E \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064F\u0639\u064E\u0644\u0651\u064E\u0645\u065E \u0645\u0651\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u064C" }, { id: 15, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064E\u0627\u0634\u0650\u0641\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0627\u0653\u0626\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u0628\u06E1\u0637\u0650\u0634\u064F \u0671\u0644\u06E1\u0628\u064E\u0637\u06E1\u0634\u064E\u0629\u064E \u0671\u0644\u06E1\u0643\u064F\u0628\u06E1\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064F\u0646\u062A\u064E\u0642\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u06DE\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0641\u064E\u062A\u064E\u0646\u0651\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u064C" }, { id: 18, text: "\u0623\u064E\u0646\u06E1 \u0623\u064E\u062F\u0651\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0639\u0650\u0628\u064E\u0627\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064C \u0623\u064E\u0645\u0650\u064A\u0646\u065E" }, { id: 19, text: "\u0648\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0621\u064E\u0627\u062A\u0650\u064A\u0643\u064F\u0645 \u0628\u0650\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 20, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0639\u064F\u0630\u06E1\u062A\u064F \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0631\u06E1\u062C\u064F\u0645\u064F\u0648\u0646\u0650" }, { id: 21, text: "\u0648\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u064A \u0641\u064E\u0671\u0639\u06E1\u062A\u064E\u0632\u0650\u0644\u064F\u0648\u0646\u0650" }, { id: 22, text: "\u0641\u064E\u062F\u064E\u0639\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646\u0651\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0642\u064E\u0648\u06E1\u0645\u065E \u0645\u0651\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0641\u064E\u0623\u064E\u0633\u06E1\u0631\u0650 \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u064A \u0644\u064E\u064A\u06E1\u0644\u064B\u0627 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u064F\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0648\u064E\u0671\u062A\u06E1\u0631\u064F\u0643\u0650 \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E \u0631\u064E\u0647\u06E1\u0648\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u062C\u064F\u0646\u062F\u065E \u0645\u0651\u064F\u063A\u06E1\u0631\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0643\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E\u0643\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u0639\u064F\u064A\u064F\u0648\u0646\u0656" }, { id: 26, text: "\u0648\u064E\u0632\u064F\u0631\u064F\u0648\u0639\u0656 \u0648\u064E\u0645\u064E\u0642\u064E\u0627\u0645\u0656 \u0643\u064E\u0631\u0650\u064A\u0645\u0656" }, { id: 27, text: "\u0648\u064E\u0646\u064E\u0639\u06E1\u0645\u064E\u0629\u0656 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u0670\u0643\u0650\u0647\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0648\u064E\u0623\u064E\u0648\u06E1\u0631\u064E\u062B\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0642\u064E\u0648\u06E1\u0645\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 29, text: "\u0641\u064E\u0645\u064E\u0627 \u0628\u064E\u0643\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0646\u0638\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0646\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0647\u0650\u064A\u0646\u0650" }, { id: 31, text: "\u0645\u0650\u0646 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0627\u0644\u0650\u064A\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u0650 \u0671\u062E\u06E1\u062A\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u0650\u0644\u06E1\u0645\u064D \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A\u0647\u0650 \u0628\u064E\u0644\u064E\u0640\u0670\u0653\u0624\u065E\u0627\u0652 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 34, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0625\u0650\u0646\u06E1 \u0647\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0648\u06E1\u062A\u064E\u062A\u064F\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u0645\u064F\u0646\u0634\u064E\u0631\u0650\u064A\u0646\u064E" }, { id: 36, text: "\u0641\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 37, text: "\u0623\u064E\u0647\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u064C \u0623\u064E\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064F \u062A\u064F\u0628\u0651\u064E\u0639\u0656 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0644\u064E\u0670\u0639\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 39, text: "\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0625\u0650\u0646\u0651\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0641\u064E\u0635\u06E1\u0644\u0650 \u0645\u0650\u064A\u0642\u064E\u0670\u062A\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0645\u064E\u0639\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A \u0645\u064E\u0648\u06E1\u0644\u064B\u0649 \u0639\u064E\u0646 \u0645\u0651\u064E\u0648\u06E1\u0644\u0657\u0649 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u0631\u0651\u064E\u062D\u0650\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 43, text: "\u0625\u0650\u0646\u0651\u064E \u0634\u064E\u062C\u064E\u0631\u064E\u062A\u064E \u0671\u0644\u0632\u0651\u064E\u0642\u0651\u064F\u0648\u0645\u0650" }, { id: 44, text: "\u0637\u064E\u0639\u064E\u0627\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u062B\u0650\u064A\u0645\u0650" }, { id: 45, text: "\u0643\u064E\u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u0644\u0650 \u064A\u064E\u063A\u06E1\u0644\u0650\u064A \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064F\u0637\u064F\u0648\u0646\u0650" }, { id: 46, text: "\u0643\u064E\u063A\u064E\u0644\u06E1\u064A\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u0645\u0650" }, { id: 47, text: "\u062E\u064F\u0630\u064F\u0648\u0647\u064F \u0641\u064E\u0671\u0639\u06E1\u062A\u0650\u0644\u064F\u0648\u0647\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 48, text: "\u062B\u064F\u0645\u0651\u064E \u0635\u064F\u0628\u0651\u064F\u0648\u0627\u0652 \u0641\u064E\u0648\u06E1\u0642\u064E \u0631\u064E\u0623\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u0645\u0650" }, { id: 49, text: "\u0630\u064F\u0642\u06E1 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u0643\u064E\u0631\u0650\u064A\u0645\u064F" }, { id: 50, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062A\u064E\u0645\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 51, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0645\u064E\u0642\u064E\u0627\u0645\u064D \u0623\u064E\u0645\u0650\u064A\u0646\u0656" }, { id: 52, text: "\u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u0639\u064F\u064A\u064F\u0648\u0646\u0656" }, { id: 53, text: "\u064A\u064E\u0644\u06E1\u0628\u064E\u0633\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0633\u064F\u0646\u062F\u064F\u0633\u0656 \u0648\u064E\u0625\u0650\u0633\u06E1\u062A\u064E\u0628\u06E1\u0631\u064E\u0642\u0656 \u0645\u0651\u064F\u062A\u064E\u0642\u064E\u0670\u0628\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 54, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0648\u064E\u0632\u064E\u0648\u0651\u064E\u062C\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u062D\u064F\u0648\u0631\u064D \u0639\u0650\u064A\u0646\u0656" }, { id: 55, text: "\u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u064D \u0621\u064E\u0627\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 56, text: "\u0644\u064E\u0627 \u064A\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0629\u064E \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670\u06D6 \u0648\u064E\u0648\u064E\u0642\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 57, text: "\u0641\u064E\u0636\u06E1\u0644\u0657\u0627 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 58, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u0651\u064E\u0631\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u0650\u0644\u0650\u0633\u064E\u0627\u0646\u0650\u0643\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0641\u064E\u0671\u0631\u06E1\u062A\u064E\u0642\u0650\u0628\u06E1 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0631\u06E1\u062A\u064E\u0642\u0650\u0628\u064F\u0648\u0646\u064E" }] }, { id: 45, name: "\u0627\u0644\u062C\u0627\u062B\u064A\u0629", transliteration: "Al-Jathiyah", type: "meccan", total_verses: 37, verses: [{ id: 1, text: "\u062D\u0645\u0653" }, { id: 2, text: "\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u0650" }, { id: 3, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 4, text: "\u0648\u064E\u0641\u0650\u064A \u062E\u064E\u0644\u06E1\u0642\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0628\u064F\u062B\u0651\u064F \u0645\u0650\u0646 \u062F\u064E\u0627\u0653\u0628\u0651\u064E\u0629\u064D \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u065E \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0648\u064E\u0671\u062E\u06E1\u062A\u0650\u0644\u064E\u0670\u0641\u0650 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u0650\u0646 \u0631\u0651\u0650\u0632\u06E1\u0642\u0656 \u0641\u064E\u0623\u064E\u062D\u06E1\u064A\u064E\u0627 \u0628\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627 \u0648\u064E\u062A\u064E\u0635\u06E1\u0631\u0650\u064A\u0641\u0650 \u0671\u0644\u0631\u0651\u0650\u064A\u064E\u0670\u062D\u0650 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u065E \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0646\u064E\u062A\u06E1\u0644\u064F\u0648\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u062D\u064E\u062F\u0650\u064A\u062B\u0650\u06ED \u0628\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0623\u064E\u0641\u0651\u064E\u0627\u0643\u064D \u0623\u064E\u062B\u0650\u064A\u0645\u0656" }, { id: 8, text: "\u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0635\u0650\u0631\u0651\u064F \u0645\u064F\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u0657\u0627 \u0643\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u06E1\u0647\u064E\u0627\u06D6 \u0641\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u06E1\u0647\u064F \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 9, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0639\u064E\u0644\u0650\u0645\u064E \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E\u0647\u064E\u0627 \u0647\u064F\u0632\u064F\u0648\u064B\u0627\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u065E" }, { id: 10, text: "\u0645\u0651\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F\u06D6 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064F\u0648\u0627\u0652 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0645\u064E\u0627 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u064C" }, { id: 11, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0647\u064F\u062F\u0657\u0649\u06D6 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u0650\u062C\u06E1\u0632\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 12, text: "\u06DE\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E \u0644\u0650\u062A\u064E\u062C\u06E1\u0631\u0650\u064A\u064E \u0671\u0644\u06E1\u0641\u064F\u0644\u06E1\u0643\u064F \u0641\u0650\u064A\u0647\u0650 \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u0650\u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0648\u064E\u0633\u064E\u062E\u0651\u064E\u0631\u064E \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0623\u0653\u064A\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u0650\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E \u0642\u064E\u0648\u06E1\u0645\u064E\u06E2\u0627 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0645\u064E\u0646\u06E1 \u0639\u064E\u0645\u0650\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u0641\u064E\u0644\u0650\u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0633\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627\u06D6 \u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u064F\u0643\u06E1\u0645\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064F\u0628\u064F\u0648\u0651\u064E\u0629\u064E \u0648\u064E\u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650 \u0648\u064E\u0641\u064E\u0636\u0651\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650\u06D6 \u0641\u064E\u0645\u064E\u0627 \u0671\u062E\u06E1\u062A\u064E\u0644\u064E\u0641\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064F \u0628\u064E\u063A\u06E1\u064A\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u064A\u064E\u0642\u06E1\u0636\u0650\u064A \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0641\u0650\u064A\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u0650 \u064A\u064E\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u062B\u064F\u0645\u0651\u064E \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u0631\u0650\u064A\u0639\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650 \u0641\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u06E1\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0646 \u064A\u064F\u063A\u06E1\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064F \u0628\u064E\u0639\u06E1\u0636\u0656\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0644\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 20, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u064E\u0635\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u065E \u0644\u0651\u0650\u0642\u064E\u0648\u06E1\u0645\u0656 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0623\u064E\u0645\u06E1 \u062D\u064E\u0633\u0650\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062C\u06E1\u062A\u064E\u0631\u064E\u062D\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650 \u0623\u064E\u0646 \u0646\u0651\u064E\u062C\u06E1\u0639\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u0657 \u0645\u0651\u064E\u062D\u06E1\u064A\u064E\u0627\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0645\u064E\u0627\u062A\u064F\u0647\u064F\u0645\u06E1\u06DA \u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0644\u0650\u062A\u064F\u062C\u06E1\u0632\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E \u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0625\u0650\u0644\u064E\u0670\u0647\u064E\u0647\u064F\u06E5 \u0647\u064E\u0648\u064E\u0649\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u0636\u064E\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u0650\u0644\u06E1\u0645\u0656 \u0648\u064E\u062E\u064E\u062A\u064E\u0645\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064E\u0645\u06E1\u0639\u0650\u0647\u0650\u06E6 \u0648\u064E\u0642\u064E\u0644\u06E1\u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0635\u064E\u0631\u0650\u0647\u0650\u06E6 \u063A\u0650\u0634\u064E\u0670\u0648\u064E\u0629\u0657 \u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0647\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0647\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u062D\u064E\u064A\u064E\u0627\u062A\u064F\u0646\u064E\u0627 \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0646\u064E\u0645\u064F\u0648\u062A\u064F \u0648\u064E\u0646\u064E\u062D\u06E1\u064A\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0647\u06E1\u0644\u0650\u0643\u064F\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u062F\u0651\u064E\u0647\u06E1\u0631\u064F\u06DA \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0644\u06E1\u0645\u064D\u06D6 \u0625\u0650\u0646\u06E1 \u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u064A\u064E\u0638\u064F\u0646\u0651\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u062D\u064F\u062C\u0651\u064E\u062A\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0626\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u0628\u064E\u0627\u0653\u0626\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u0642\u064F\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u062D\u06E1\u064A\u0650\u064A\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0645\u0650\u064A\u062A\u064F\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0644\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0642\u064F\u0648\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064E\u062E\u06E1\u0633\u064E\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u06E1\u0637\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u064E \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u062C\u064E\u0627\u062B\u0650\u064A\u064E\u0629\u0657\u06DA \u0643\u064F\u0644\u0651\u064F \u0623\u064F\u0645\u0651\u064E\u0629\u0656 \u062A\u064F\u062F\u06E1\u0639\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0643\u0650\u062A\u064E\u0670\u0628\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u064F\u0646\u064E\u0627 \u064A\u064E\u0646\u0637\u0650\u0642\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u0633\u06E1\u062A\u064E\u0646\u0633\u0650\u062E\u064F \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0641\u064E\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064F\u0647\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 31, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0643\u064F\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u064A \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0645\u0651\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0625\u0650\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u065E \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u0644\u064E\u0627 \u0631\u064E\u064A\u06E1\u0628\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0642\u064F\u0644\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u0646\u064E\u062F\u06E1\u0631\u0650\u064A \u0645\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u0625\u0650\u0646 \u0646\u0651\u064E\u0638\u064F\u0646\u0651\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0638\u064E\u0646\u0651\u0657\u0627 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u0645\u064F\u0633\u06E1\u062A\u064E\u064A\u06E1\u0642\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0628\u064E\u062F\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u064F \u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u062D\u064E\u0627\u0642\u064E \u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u0646\u0633\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627 \u0646\u064E\u0633\u0650\u064A\u062A\u064F\u0645\u06E1 \u0644\u0650\u0642\u064E\u0627\u0653\u0621\u064E \u064A\u064E\u0648\u06E1\u0645\u0650\u0643\u064F\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0643\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0640\u0670\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 35, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645 \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u064F \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u06E1\u062A\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0632\u064F\u0648\u0657\u0627 \u0648\u064E\u063A\u064E\u0631\u0651\u064E\u062A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06DA \u0641\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u064A\u064F\u062E\u06E1\u0631\u064E\u062C\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0633\u06E1\u062A\u064E\u0639\u06E1\u062A\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0641\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 37, text: "\u0648\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0643\u0650\u0628\u06E1\u0631\u0650\u064A\u064E\u0627\u0653\u0621\u064F \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }] }, { id: 46, name: "\u0627\u0644\u0623\u062D\u0642\u0627\u0641", transliteration: "Al-Ahqaf", type: "meccan", total_verses: 35, verses: [{ id: 1, text: "\u062D\u0645\u0653" }, { id: 2, text: "\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u0650" }, { id: 3, text: "\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u0657\u0649\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0645\u0651\u064E\u0627\u0653 \u0623\u064F\u0646\u0630\u0650\u0631\u064F\u0648\u0627\u0652 \u0645\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0631\u064F\u0648\u0646\u0650\u064A \u0645\u064E\u0627\u0630\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0634\u0650\u0631\u06E1\u0643\u065E \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650\u06D6 \u0671\u0626\u06E1\u062A\u064F\u0648\u0646\u0650\u064A \u0628\u0650\u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1 \u0623\u064E\u062B\u064E\u0670\u0631\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0644\u06E1\u0645\u064D \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 5, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064F \u0645\u0650\u0645\u0651\u064E\u0646 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0646 \u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u062C\u0650\u064A\u0628\u064F \u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646 \u062F\u064F\u0639\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u063A\u064E\u0670\u0641\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062D\u064F\u0634\u0650\u0631\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u062F\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0639\u0650\u0628\u064E\u0627\u062F\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 8, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F\u06D6 \u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u064A\u06E1\u062A\u064F\u0647\u064F\u06E5 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0644\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627\u06D6 \u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064F\u0641\u0650\u064A\u0636\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u0650\u06DA \u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0647\u0650\u06E6 \u0634\u064E\u0647\u0650\u064A\u062F\u064E\u06E2\u0627 \u0628\u064E\u064A\u06E1\u0646\u0650\u064A \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 9, text: "\u0642\u064F\u0644\u06E1 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F \u0628\u0650\u062F\u06E1\u0639\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u0650 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u0650\u064A \u0645\u064E\u0627 \u064A\u064F\u0641\u06E1\u0639\u064E\u0644\u064F \u0628\u0650\u064A \u0648\u064E\u0644\u064E\u0627 \u0628\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u064A\u064F\u0648\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0625\u0650\u0644\u0651\u064E\u0627 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 10, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0643\u064E\u0641\u064E\u0631\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0634\u064E\u0647\u0650\u062F\u064E \u0634\u064E\u0627\u0647\u0650\u062F\u065E \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u0640\u0654\u064E\u0627\u0645\u064E\u0646\u064E \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u064E\u0627 \u0633\u064E\u0628\u064E\u0642\u064F\u0648\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u06DA \u0648\u064E\u0625\u0650\u0630\u06E1 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0647\u06E1\u062A\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u0641\u064E\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0641\u06E1\u0643\u065E \u0642\u064E\u062F\u0650\u064A\u0645\u065E" }, { id: 12, text: "\u0648\u064E\u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0643\u0650\u062A\u064E\u0670\u0628\u064F \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0645\u064E\u0627\u0645\u0657\u0627 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657\u06DA \u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u065E \u0645\u0651\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u065E \u0644\u0651\u0650\u0633\u064E\u0627\u0646\u064B\u0627 \u0639\u064E\u0631\u064E\u0628\u0650\u064A\u0651\u0657\u0627 \u0644\u0651\u0650\u064A\u064F\u0646\u0630\u0650\u0631\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0648\u064E\u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 13, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u0642\u064E\u0670\u0645\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0627 \u062E\u064E\u0648\u06E1\u0641\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0632\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064E\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0648\u064E\u0648\u064E\u0635\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0628\u0650\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0647\u0650 \u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u064B\u0627\u06D6 \u062D\u064E\u0645\u064E\u0644\u064E\u062A\u06E1\u0647\u064F \u0623\u064F\u0645\u0651\u064F\u0647\u064F\u06E5 \u0643\u064F\u0631\u06E1\u0647\u0657\u0627 \u0648\u064E\u0648\u064E\u0636\u064E\u0639\u064E\u062A\u06E1\u0647\u064F \u0643\u064F\u0631\u06E1\u0647\u0657\u0627\u06D6 \u0648\u064E\u062D\u064E\u0645\u06E1\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0641\u0650\u0635\u064E\u0670\u0644\u064F\u0647\u064F\u06E5 \u062B\u064E\u0644\u064E\u0670\u062B\u064F\u0648\u0646\u064E \u0634\u064E\u0647\u06E1\u0631\u064B\u0627\u06DA \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E \u0623\u064E\u0634\u064F\u062F\u0651\u064E\u0647\u064F\u06E5 \u0648\u064E\u0628\u064E\u0644\u064E\u063A\u064E \u0623\u064E\u0631\u06E1\u0628\u064E\u0639\u0650\u064A\u0646\u064E \u0633\u064E\u0646\u064E\u0629\u0657 \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0623\u064E\u0648\u06E1\u0632\u0650\u0639\u06E1\u0646\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0634\u06E1\u0643\u064F\u0631\u064E \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1\u0639\u064E\u0645\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0648\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u0651\u064E \u0648\u064E\u0623\u064E\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0644\u064E \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u062A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670\u0647\u064F \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u0650\u062D\u06E1 \u0644\u0650\u064A \u0641\u0650\u064A \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u0650\u064A\u0653\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A \u062A\u064F\u0628\u06E1\u062A\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 16, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0646\u064E\u062A\u064E\u0642\u064E\u0628\u0651\u064E\u0644\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0646\u064E\u062A\u064E\u062C\u064E\u0627\u0648\u064E\u0632\u064F \u0639\u064E\u0646 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650\u06D6 \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0635\u0651\u0650\u062F\u06E1\u0642\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0647\u0650 \u0623\u064F\u0641\u0651\u0656 \u0644\u0651\u064E\u0643\u064F\u0645\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0639\u0650\u062F\u064E\u0627\u0646\u0650\u0646\u0650\u064A\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064F\u062E\u06E1\u0631\u064E\u062C\u064E \u0648\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u0642\u064F\u0631\u064F\u0648\u0646\u064F \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u064A \u0648\u064E\u0647\u064F\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u0650\u064A\u062B\u064E\u0627\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u064A\u06E1\u0644\u064E\u0643\u064E \u0621\u064E\u0627\u0645\u0650\u0646\u06E1 \u0625\u0650\u0646\u0651\u064E \u0648\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u0642\u0651\u065E \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0645\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u064E\u0670\u0637\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062D\u064E\u0642\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0641\u0650\u064A\u0653 \u0623\u064F\u0645\u064E\u0645\u0656 \u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u062E\u064E\u0670\u0633\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u0644\u0650\u0643\u064F\u0644\u0651\u0656 \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u065E \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0644\u0650\u064A\u064F\u0648\u064E\u0641\u0651\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0639\u06E1\u0631\u064E\u0636\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0623\u064E\u0630\u06E1\u0647\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u062D\u064E\u064A\u064E\u0627\u062A\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0645\u06E1\u062A\u064E\u0639\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u064E\u0627 \u0641\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u0647\u064F\u0648\u0646\u0650 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0641\u06E1\u0633\u064F\u0642\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u06DE\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u06E1 \u0623\u064E\u062E\u064E\u0627 \u0639\u064E\u0627\u062F\u064D \u0625\u0650\u0630\u06E1 \u0623\u064E\u0646\u0630\u064E\u0631\u064E \u0642\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0642\u064E\u0627\u0641\u0650 \u0648\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u0650 \u0671\u0644\u0646\u0651\u064F\u0630\u064F\u0631\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650 \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 22, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062C\u0650\u0626\u06E1\u062A\u064E\u0646\u064E\u0627 \u0644\u0650\u062A\u064E\u0623\u06E1\u0641\u0650\u0643\u064E\u0646\u064E\u0627 \u0639\u064E\u0646\u06E1 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u0650\u0646\u064E\u0627 \u0641\u064E\u0623\u06E1\u062A\u0650\u0646\u064E\u0627 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u0650\u062F\u064F\u0646\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 23, text: "\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064F \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064F\u0628\u064E\u0644\u0651\u0650\u063A\u064F\u0643\u064F\u0645 \u0645\u0651\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u06E1\u062A\u064F \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0631\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u062A\u064E\u062C\u06E1\u0647\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0647\u064F \u0639\u064E\u0627\u0631\u0650\u0636\u0657\u0627 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u06E1\u0628\u0650\u0644\u064E \u0623\u064E\u0648\u06E1\u062F\u0650\u064A\u064E\u062A\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u064E\u0627 \u0639\u064E\u0627\u0631\u0650\u0636\u065E \u0645\u0651\u064F\u0645\u06E1\u0637\u0650\u0631\u064F\u0646\u064E\u0627\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0648\u064E \u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u064E\u0644\u06E1\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0631\u0650\u064A\u062D\u065E \u0641\u0650\u064A\u0647\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 25, text: "\u062A\u064F\u062F\u064E\u0645\u0651\u0650\u0631\u064F \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u0650\u06ED \u0628\u0650\u0623\u064E\u0645\u06E1\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u064E\u0627 \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064F\u0631\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u064F\u0647\u064F\u0645\u06E1\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0645\u064E\u0643\u0651\u064E\u0646\u0651\u064E\u0640\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0645\u064E\u0627\u0653 \u0625\u0650\u0646 \u0645\u0651\u064E\u0643\u0651\u064E\u0646\u0651\u064E\u0640\u0670\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u0645\u06E1\u0639\u0657\u0627 \u0648\u064E\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0657\u0627 \u0648\u064E\u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u0629\u0657 \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u0645\u06E1\u0639\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u062A\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D \u0625\u0650\u0630\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u062C\u06E1\u062D\u064E\u062F\u064F\u0648\u0646\u064E \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u062D\u064E\u0627\u0642\u064E \u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u062A\u064E\u0647\u06E1\u0632\u0650\u0621\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u062D\u064E\u0648\u06E1\u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670 \u0648\u064E\u0635\u064E\u0631\u0651\u064E\u0641\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0646\u064E\u0635\u064E\u0631\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0642\u064F\u0631\u06E1\u0628\u064E\u0627\u0646\u064B\u0627 \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u0629\u064E\u06E2\u06D6 \u0628\u064E\u0644\u06E1 \u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0625\u0650\u0641\u06E1\u0643\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0635\u064E\u0631\u064E\u0641\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0646\u064E\u0641\u064E\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u064A\u064E\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062D\u064E\u0636\u064E\u0631\u064F\u0648\u0647\u064F \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0635\u0650\u062A\u064F\u0648\u0627\u0652\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0642\u064F\u0636\u0650\u064A\u064E \u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u0646\u0630\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u064B\u0627 \u0623\u064F\u0646\u0632\u0650\u0644\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0645\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0625\u0650\u0644\u064E\u0649\u0670 \u0637\u064E\u0631\u0650\u064A\u0642\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 31, text: "\u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u062C\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u062F\u064E\u0627\u0639\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u062C\u0650\u0631\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 32, text: "\u0648\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0627 \u064A\u064F\u062C\u0650\u0628\u06E1 \u062F\u064E\u0627\u0639\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0628\u0650\u0645\u064F\u0639\u06E1\u062C\u0650\u0632\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064F\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 33, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0639\u06E1\u064A\u064E \u0628\u0650\u062E\u064E\u0644\u06E1\u0642\u0650\u0647\u0650\u0646\u0651\u064E \u0628\u0650\u0642\u064E\u0670\u062F\u0650\u0631\u064D \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064F\u062D\u06E1\u0640\u06E7\u0650\u064A\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670\u06DA \u0628\u064E\u0644\u064E\u0649\u0670\u0653\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 34, text: "\u0648\u064E\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0639\u06E1\u0631\u064E\u0636\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627\u06DA \u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0643\u064E\u0645\u064E\u0627 \u0635\u064E\u0628\u064E\u0631\u064E \u0623\u064F\u0648\u0652\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u064E\u0632\u06E1\u0645\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1\u06DA \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E \u0645\u064E\u0627 \u064A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0644\u06E1\u0628\u064E\u062B\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u064E\u0627\u0639\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650\u06ED\u06DA \u0628\u064E\u0644\u064E\u0670\u063A\u065E\u06DA \u0641\u064E\u0647\u064E\u0644\u06E1 \u064A\u064F\u0647\u06E1\u0644\u064E\u0643\u064F \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }] }, { id: 47, name: "\u0645\u062D\u0645\u062F", transliteration: "Muhammad", type: "medinan", total_verses: 38, verses: [{ id: 1, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0635\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0636\u064E\u0644\u0651\u064E \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 2, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0648\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0646\u064F\u0632\u0651\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064F\u062D\u064E\u0645\u0651\u064E\u062F\u0656 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0643\u064E\u0641\u0651\u064E\u0631\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0635\u06E1\u0644\u064E\u062D\u064E \u0628\u064E\u0627\u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 3, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0628\u064E\u0670\u0637\u0650\u0644\u064E \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 4, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0644\u064E\u0642\u0650\u064A\u062A\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0636\u064E\u0631\u06E1\u0628\u064E \u0671\u0644\u0631\u0651\u0650\u0642\u064E\u0627\u0628\u0650 \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u062B\u06E1\u062E\u064E\u0646\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0641\u064E\u0634\u064F\u062F\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0648\u064E\u062B\u064E\u0627\u0642\u064E \u0641\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u0651\u064E\u06E2\u0627 \u0628\u064E\u0639\u06E1\u062F\u064F \u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u0641\u0650\u062F\u064E\u0627\u0653\u0621\u064B \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0636\u064E\u0639\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u06E1\u0628\u064F \u0623\u064E\u0648\u06E1\u0632\u064E\u0627\u0631\u064E\u0647\u064E\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0671\u0646\u062A\u064E\u0635\u064E\u0631\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u0650\u064A\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0627\u0652 \u0628\u064E\u0639\u06E1\u0636\u064E\u0643\u064F\u0645 \u0628\u0650\u0628\u064E\u0639\u06E1\u0636\u0656\u06D7 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064F\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u064E\u0646 \u064A\u064F\u0636\u0650\u0644\u0651\u064E \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 5, text: "\u0633\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064F\u0635\u06E1\u0644\u0650\u062D\u064F \u0628\u064E\u0627\u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 6, text: "\u0648\u064E\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0639\u064E\u0631\u0651\u064E\u0641\u064E\u0647\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 7, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u062A\u064E\u0646\u0635\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0646\u0635\u064F\u0631\u06E1\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u062B\u064E\u0628\u0651\u0650\u062A\u06E1 \u0623\u064E\u0642\u06E1\u062F\u064E\u0627\u0645\u064E\u0643\u064F\u0645\u06E1" }, { id: 8, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u062A\u064E\u0639\u06E1\u0633\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0636\u064E\u0644\u0651\u064E \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 9, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0631\u0650\u0647\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0623\u064E\u062D\u06E1\u0628\u064E\u0637\u064E \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 10, text: "\u06DE\u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0633\u0650\u064A\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06D6 \u062F\u064E\u0645\u0651\u064E\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06D6 \u0648\u064E\u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u064F\u0647\u064E\u0627" }, { id: 11, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0648\u06E1\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 12, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06D6 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u064A\u064E\u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0646\u064E \u0648\u064E\u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0643\u064E\u0645\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u064F \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0645\u064E\u062B\u06E1\u0648\u0657\u0649 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1" }, { id: 13, text: "\u0648\u064E\u0643\u064E\u0623\u064E\u064A\u0651\u0650\u0646 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0647\u0650\u064A\u064E \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0642\u064F\u0648\u0651\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u062A\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E\u062A\u06E1\u0643\u064E \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u0646\u064E\u0627\u0635\u0650\u0631\u064E \u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 14, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0643\u064E\u0645\u064E\u0646 \u0632\u064F\u064A\u0651\u0650\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0633\u064F\u0648\u0653\u0621\u064F \u0639\u064E\u0645\u064E\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645" }, { id: 15, text: "\u0645\u0651\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0648\u064F\u0639\u0650\u062F\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E\u06D6 \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u065E \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0627\u0653\u0621\u064D \u063A\u064E\u064A\u06E1\u0631\u0650 \u0621\u064E\u0627\u0633\u0650\u0646\u0656 \u0648\u064E\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u065E \u0645\u0651\u0650\u0646 \u0644\u0651\u064E\u0628\u064E\u0646\u0656 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062A\u064E\u063A\u064E\u064A\u0651\u064E\u0631\u06E1 \u0637\u064E\u0639\u06E1\u0645\u064F\u0647\u064F\u06E5 \u0648\u064E\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u065E \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u0645\u06E1\u0631\u0656 \u0644\u0651\u064E\u0630\u0651\u064E\u0629\u0656 \u0644\u0651\u0650\u0644\u0634\u0651\u064E\u0640\u0670\u0631\u0650\u0628\u0650\u064A\u0646\u064E \u0648\u064E\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u065E \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0633\u064E\u0644\u0656 \u0645\u0651\u064F\u0635\u064E\u0641\u0651\u0657\u0649\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0671\u0644\u062B\u0651\u064E\u0645\u064E\u0631\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0643\u064E\u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u065E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0648\u064E\u0633\u064F\u0642\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653\u0621\u064B \u062D\u064E\u0645\u0650\u064A\u0645\u0657\u0627 \u0641\u064E\u0642\u064E\u0637\u0651\u064E\u0639\u064E \u0623\u064E\u0645\u06E1\u0639\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1" }, { id: 16, text: "\u0648\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u062E\u064E\u0631\u064E\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0643\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064E \u0645\u064E\u0627\u0630\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0621\u064E\u0627\u0646\u0650\u0641\u064B\u0627\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0637\u064E\u0628\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1" }, { id: 17, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0648\u06E1\u0627\u0652 \u0632\u064E\u0627\u062F\u064E\u0647\u064F\u0645\u06E1 \u0647\u064F\u062F\u0657\u0649 \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062A\u064E\u0642\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1" }, { id: 18, text: "\u0641\u064E\u0647\u064E\u0644\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064E \u0623\u064E\u0646 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645 \u0628\u064E\u063A\u06E1\u062A\u064E\u0629\u0657\u06D6 \u0641\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0634\u06E1\u0631\u064E\u0627\u0637\u064F\u0647\u064E\u0627\u06DA \u0641\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670\u0647\u064F\u0645\u06E1" }, { id: 19, text: "\u0641\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u0650\u0630\u064E\u0646\u06E2\u0628\u0650\u0643\u064E \u0648\u064E\u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064F\u062A\u064E\u0642\u064E\u0644\u0651\u064E\u0628\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u062B\u06E1\u0648\u064E\u0649\u0670\u0643\u064F\u0645\u06E1" }, { id: 20, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0646\u064F\u0632\u0651\u0650\u0644\u064E\u062A\u06E1 \u0633\u064F\u0648\u0631\u064E\u0629\u065E\u06D6 \u0641\u064E\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064F\u0646\u0632\u0650\u0644\u064E\u062A\u06E1 \u0633\u064F\u0648\u0631\u064E\u0629\u065E \u0645\u0651\u064F\u062D\u06E1\u0643\u064E\u0645\u064E\u0629\u065E \u0648\u064E\u0630\u064F\u0643\u0650\u0631\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0671\u0644\u06E1\u0642\u0650\u062A\u064E\u0627\u0644\u064F \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u065E \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0646\u064E\u0638\u064E\u0631\u064E \u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0634\u0650\u064A\u0651\u0650 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650\u06D6 \u0641\u064E\u0623\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 21, text: "\u0637\u064E\u0627\u0639\u064E\u0629\u065E \u0648\u064E\u0642\u064E\u0648\u06E1\u0644\u065E \u0645\u0651\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u065E\u06DA \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0639\u064E\u0632\u064E\u0645\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u0641\u064E\u0644\u064E\u0648\u06E1 \u0635\u064E\u062F\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0643\u064E\u0627\u0646\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1" }, { id: 22, text: "\u0641\u064E\u0647\u064E\u0644\u06E1 \u0639\u064E\u0633\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064F\u0641\u06E1\u0633\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u062A\u064F\u0642\u064E\u0637\u0651\u0650\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u064E\u0643\u064F\u0645\u06E1" }, { id: 23, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0639\u064E\u0646\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u064E\u0623\u064E\u0635\u064E\u0645\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670\u0653 \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064E\u0647\u064F\u0645\u06E1" }, { id: 24, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u062A\u064E\u062F\u064E\u0628\u0651\u064E\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0623\u064E\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u064D \u0623\u064E\u0642\u06E1\u0641\u064E\u0627\u0644\u064F\u0647\u064E\u0627\u0653" }, { id: 25, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0631\u06E1\u062A\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062F\u06E1\u0628\u064E\u0670\u0631\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0633\u064E\u0648\u0651\u064E\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0645\u06E1\u0644\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 26, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0631\u0650\u0647\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0646\u064F\u0637\u0650\u064A\u0639\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0628\u064E\u0639\u06E1\u0636\u0650 \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0625\u0650\u0633\u06E1\u0631\u064E\u0627\u0631\u064E\u0647\u064F\u0645\u06E1" }, { id: 27, text: "\u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u0648\u064E\u0641\u0651\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u064F\u0648\u0646\u064E \u0648\u064F\u062C\u064F\u0648\u0647\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u062F\u06E1\u0628\u064E\u0670\u0631\u064E\u0647\u064F\u0645\u06E1" }, { id: 28, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u064F \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u062E\u064E\u0637\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0643\u064E\u0631\u0650\u0647\u064F\u0648\u0627\u0652 \u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u064E\u0647\u064F\u06E5 \u0641\u064E\u0623\u064E\u062D\u06E1\u0628\u064E\u0637\u064E \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 29, text: "\u0623\u064E\u0645\u06E1 \u062D\u064E\u0633\u0650\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u064C \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0636\u06E1\u063A\u064E\u0670\u0646\u064E\u0647\u064F\u0645\u06E1" }, { id: 30, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0644\u064E\u0623\u064E\u0631\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0639\u064E\u0631\u064E\u0641\u06E1\u062A\u064E\u0647\u064F\u0645 \u0628\u0650\u0633\u0650\u064A\u0645\u064E\u0670\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0644\u064E\u062A\u064E\u0639\u06E1\u0631\u0650\u0641\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0644\u064E\u062D\u06E1\u0646\u0650 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0643\u064F\u0645\u06E1" }, { id: 31, text: "\u0648\u064E\u0644\u064E\u0646\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u06E1\u0645\u064F\u062C\u064E\u0670\u0647\u0650\u062F\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0628\u0650\u0631\u0650\u064A\u0646\u064E \u0648\u064E\u0646\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0627\u0652 \u0623\u064E\u062E\u06E1\u0628\u064E\u0627\u0631\u064E\u0643\u064F\u0645\u06E1" }, { id: 32, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0635\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0634\u064E\u0627\u0653\u0642\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0644\u064E\u0646 \u064A\u064E\u0636\u064F\u0631\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0633\u064E\u064A\u064F\u062D\u06E1\u0628\u0650\u0637\u064F \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 33, text: "\u06DE\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0628\u06E1\u0637\u0650\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0643\u064F\u0645\u06E1" }, { id: 34, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0635\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062B\u064F\u0645\u0651\u064E \u0645\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0643\u064F\u0641\u0651\u064E\u0627\u0631\u065E \u0641\u064E\u0644\u064E\u0646 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 35, text: "\u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0647\u0650\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0633\u0651\u064E\u0644\u06E1\u0645\u0650 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0646 \u064A\u064E\u062A\u0650\u0631\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0643\u064F\u0645\u06E1" }, { id: 36, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0644\u064E\u0639\u0650\u0628\u065E \u0648\u064E\u0644\u064E\u0647\u06E1\u0648\u065E\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u064A\u064F\u0624\u06E1\u062A\u0650\u0643\u064F\u0645\u06E1 \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064E\u0643\u064F\u0645\u06E1" }, { id: 37, text: "\u0625\u0650\u0646 \u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u06E1\u0643\u064F\u0645\u064F\u0648\u0647\u064E\u0627 \u0641\u064E\u064A\u064F\u062D\u06E1\u0641\u0650\u0643\u064F\u0645\u06E1 \u062A\u064E\u0628\u06E1\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u06E1 \u0623\u064E\u0636\u06E1\u063A\u064E\u0670\u0646\u064E\u0643\u064F\u0645\u06E1" }, { id: 38, text: "\u0647\u064E\u0640\u0670\u0653\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u062A\u064F\u062F\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0644\u0650\u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0646 \u064A\u064E\u0628\u06E1\u062E\u064E\u0644\u064F\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0628\u06E1\u062E\u064E\u0644\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0628\u06E1\u062E\u064E\u0644\u064F \u0639\u064E\u0646 \u0646\u0651\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u063A\u064E\u0646\u0650\u064A\u0651\u064F \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064F\u0642\u064E\u0631\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u064A\u064E\u0633\u06E1\u062A\u064E\u0628\u06E1\u062F\u0650\u0644\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E\u0643\u064F\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u064E\u0643\u064F\u0645" }] }, { id: 48, name: "\u0627\u0644\u0641\u062A\u062D", transliteration: "Al-Fath", type: "medinan", total_verses: 29, verses: [{ id: 1, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0641\u064E\u062A\u064E\u062D\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064E \u0641\u064E\u062A\u06E1\u062D\u0657\u0627 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0657\u0627" }, { id: 2, text: "\u0644\u0651\u0650\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0644\u064E\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0627 \u062A\u064E\u0642\u064E\u062F\u0651\u064E\u0645\u064E \u0645\u0650\u0646 \u0630\u064E\u0646\u06E2\u0628\u0650\u0643\u064E \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0623\u064E\u062E\u0651\u064E\u0631\u064E \u0648\u064E\u064A\u064F\u062A\u0650\u0645\u0651\u064E \u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u064E\u0643\u064E \u0635\u0650\u0631\u064E\u0670\u0637\u0657\u0627 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0657\u0627" }, { id: 3, text: "\u0648\u064E\u064A\u064E\u0646\u0635\u064F\u0631\u064E\u0643\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0646\u064E\u0635\u06E1\u0631\u064B\u0627 \u0639\u064E\u0632\u0650\u064A\u0632\u064B\u0627" }, { id: 4, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0633\u0651\u064E\u0643\u0650\u064A\u0646\u064E\u0629\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0644\u0650\u064A\u064E\u0632\u06E1\u062F\u064E\u0627\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0657\u0627 \u0645\u0651\u064E\u0639\u064E \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1\u06D7 \u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u062C\u064F\u0646\u064F\u0648\u062F\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 5, text: "\u0644\u0651\u0650\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u064A\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0648\u06E1\u0632\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 6, text: "\u0648\u064E\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u064E\u0670\u062A\u0650 \u0671\u0644\u0638\u0651\u064E\u0627\u0653\u0646\u0651\u0650\u064A\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0638\u064E\u0646\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0648\u06E1\u0621\u0650\u06DA \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062F\u064E\u0627\u0653\u0626\u0650\u0631\u064E\u0629\u064F \u0671\u0644\u0633\u0651\u064E\u0648\u06E1\u0621\u0650\u06D6 \u0648\u064E\u063A\u064E\u0636\u0650\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0639\u064E\u0646\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E\u06D6 \u0648\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0645\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 7, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u062C\u064F\u0646\u064F\u0648\u062F\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u064B\u0627" }, { id: 8, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064E \u0634\u064E\u0670\u0647\u0650\u062F\u0657\u0627 \u0648\u064E\u0645\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u0657\u0627 \u0648\u064E\u0646\u064E\u0630\u0650\u064A\u0631\u0657\u0627" }, { id: 9, text: "\u0644\u0651\u0650\u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u062A\u064F\u0639\u064E\u0632\u0651\u0650\u0631\u064F\u0648\u0647\u064F \u0648\u064E\u062A\u064F\u0648\u064E\u0642\u0651\u0650\u0631\u064F\u0648\u0647\u064F\u06DA \u0648\u064E\u062A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0647\u064F \u0628\u064F\u0643\u06E1\u0631\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0635\u0650\u064A\u0644\u064B\u0627" }, { id: 10, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0628\u064E\u0627\u064A\u0650\u0639\u064F\u0648\u0646\u064E\u0643\u064E \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064F\u0628\u064E\u0627\u064A\u0650\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0648\u06E1\u0642\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1\u06DA \u0641\u064E\u0645\u064E\u0646 \u0646\u0651\u064E\u0643\u064E\u062B\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0646\u0643\u064F\u062B\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0648\u06E1\u0641\u064E\u0649\u0670 \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0670\u0647\u064E\u062F\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0633\u064E\u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u0647\u0650 \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u0657\u0627" }, { id: 11, text: "\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u064E\u0643\u064E \u0671\u0644\u06E1\u0645\u064F\u062E\u064E\u0644\u0651\u064E\u0641\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0628\u0650 \u0634\u064E\u063A\u064E\u0644\u064E\u062A\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064F\u0646\u064E\u0627 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064F\u0648\u0646\u064E\u0627 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627\u06DA \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0623\u064E\u0644\u06E1\u0633\u0650\u0646\u064E\u062A\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0644\u064E\u064A\u06E1\u0633\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1\u06DA \u0642\u064F\u0644\u06E1 \u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0636\u064E\u0631\u0651\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0646\u064E\u0641\u06E1\u0639\u064E\u06E2\u0627\u06DA \u0628\u064E\u0644\u06E1 \u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u064E\u06E2\u0627" }, { id: 12, text: "\u0628\u064E\u0644\u06E1 \u0638\u064E\u0646\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u064A\u064E\u0646\u0642\u064E\u0644\u0650\u0628\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064E\u0628\u064E\u062F\u0657\u0627 \u0648\u064E\u0632\u064F\u064A\u0651\u0650\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0638\u064E\u0646\u064E\u0646\u062A\u064F\u0645\u06E1 \u0638\u064E\u0646\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0648\u06E1\u0621\u0650 \u0648\u064E\u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064E\u06E2\u0627 \u0628\u064F\u0648\u0631\u0657\u0627" }, { id: 13, text: "\u0648\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u06E2 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0633\u064E\u0639\u0650\u064A\u0631\u0657\u0627" }, { id: 14, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u0657\u0627 \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 15, text: "\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u062E\u064E\u0644\u0651\u064E\u0641\u064F\u0648\u0646\u064E \u0625\u0650\u0630\u064E\u0627 \u0671\u0646\u0637\u064E\u0644\u064E\u0642\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u063A\u064E\u0627\u0646\u0650\u0645\u064E \u0644\u0650\u062A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0647\u064E\u0627 \u0630\u064E\u0631\u064F\u0648\u0646\u064E\u0627 \u0646\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u06E1\u0643\u064F\u0645\u06E1\u06D6 \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0646 \u064A\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064F\u0648\u0627\u0652 \u0643\u064E\u0644\u064E\u0670\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0642\u064F\u0644 \u0644\u0651\u064E\u0646 \u062A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E\u0627 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0641\u064E\u0633\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0644\u06E1 \u062A\u064E\u062D\u06E1\u0633\u064F\u062F\u064F\u0648\u0646\u064E\u0646\u064E\u0627\u06DA \u0628\u064E\u0644\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 16, text: "\u0642\u064F\u0644 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062E\u064E\u0644\u0651\u064E\u0641\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0628\u0650 \u0633\u064E\u062A\u064F\u062F\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u064D \u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0628\u064E\u0623\u06E1\u0633\u0656 \u0634\u064E\u062F\u0650\u064A\u062F\u0656 \u062A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u064A\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E\u06D6 \u0641\u064E\u0625\u0650\u0646 \u062A\u064F\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u064A\u064F\u0624\u06E1\u062A\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0643\u064E\u0645\u064E\u0627 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u06E1\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 17, text: "\u0644\u0651\u064E\u064A\u06E1\u0633\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670 \u062D\u064E\u0631\u064E\u062C\u065E \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u062C\u0650 \u062D\u064E\u0631\u064E\u062C\u065E \u0648\u064E\u0644\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0631\u0650\u064A\u0636\u0650 \u062D\u064E\u0631\u064E\u062C\u065E\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0637\u0650\u0639\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u06E1\u0647\u064F \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u06E1\u0647\u064F \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 18, text: "\u06DE\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0631\u064E\u0636\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u06E1 \u064A\u064F\u0628\u064E\u0627\u064A\u0650\u0639\u064F\u0648\u0646\u064E\u0643\u064E \u062A\u064E\u062D\u06E1\u062A\u064E \u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u064E\u0629\u0650 \u0641\u064E\u0639\u064E\u0644\u0650\u0645\u064E \u0645\u064E\u0627 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0633\u0651\u064E\u0643\u0650\u064A\u0646\u064E\u0629\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u062B\u064E\u0670\u0628\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u062A\u06E1\u062D\u0657\u0627 \u0642\u064E\u0631\u0650\u064A\u0628\u0657\u0627" }, { id: 19, text: "\u0648\u064E\u0645\u064E\u063A\u064E\u0627\u0646\u0650\u0645\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u0657 \u064A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0646\u064E\u0647\u064E\u0627\u06D7 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0632\u0650\u064A\u0632\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 20, text: "\u0648\u064E\u0639\u064E\u062F\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u063A\u064E\u0627\u0646\u0650\u0645\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u0657 \u062A\u064E\u0623\u06E1\u062E\u064F\u0630\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u0641\u064E\u0639\u064E\u062C\u0651\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u0648\u064E\u0643\u064E\u0641\u0651\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u062A\u064E\u0643\u064F\u0648\u0646\u064E \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u064E\u0643\u064F\u0645\u06E1 \u0635\u0650\u0631\u064E\u0670\u0637\u0657\u0627 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0657\u0627" }, { id: 21, text: "\u0648\u064E\u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0642\u064E\u062F\u06E1 \u0623\u064E\u062D\u064E\u0627\u0637\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u064E\u0627\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u0657\u0627" }, { id: 22, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0642\u064E\u0670\u062A\u064E\u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0623\u064E\u062F\u06E1\u0628\u064E\u0670\u0631\u064E \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u0650\u064A\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 23, text: "\u0633\u064F\u0646\u0651\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0648\u064E\u0644\u064E\u0646 \u062A\u064E\u062C\u0650\u062F\u064E \u0644\u0650\u0633\u064F\u0646\u0651\u064E\u0629\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0628\u06E1\u062F\u0650\u064A\u0644\u0657\u0627" }, { id: 24, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064E\u0641\u0651\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645 \u0628\u0650\u0628\u064E\u0637\u06E1\u0646\u0650 \u0645\u064E\u0643\u0651\u064E\u0629\u064E \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0641\u064E\u0631\u064E\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u064B\u0627" }, { id: 25, text: "\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0635\u064E\u062F\u0651\u064F\u0648\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u0650 \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u0647\u064E\u062F\u06E1\u064A\u064E \u0645\u064E\u0639\u06E1\u0643\u064F\u0648\u0641\u064B\u0627 \u0623\u064E\u0646 \u064A\u064E\u0628\u06E1\u0644\u064F\u063A\u064E \u0645\u064E\u062D\u0650\u0644\u0651\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u0631\u0650\u062C\u064E\u0627\u0644\u065E \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0648\u064E\u0646\u0650\u0633\u064E\u0627\u0653\u0621\u065E \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u065E \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0637\u064E\u0640\u0654\u064F\u0648\u0647\u064F\u0645\u06E1 \u0641\u064E\u062A\u064F\u0635\u0650\u064A\u0628\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0639\u064E\u0631\u0651\u064E\u0629\u064F\u06E2 \u0628\u0650\u063A\u064E\u064A\u06E1\u0631\u0650 \u0639\u0650\u0644\u06E1\u0645\u0656\u06D6 \u0644\u0651\u0650\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0644\u064E\u0648\u06E1 \u062A\u064E\u0632\u064E\u064A\u0651\u064E\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0639\u064E\u0630\u0651\u064E\u0628\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u064B\u0627" }, { id: 26, text: "\u0625\u0650\u0630\u06E1 \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u0651\u064E\u0629\u064E \u062D\u064E\u0645\u0650\u064A\u0651\u064E\u0629\u064E \u0671\u0644\u06E1\u062C\u064E\u0670\u0647\u0650\u0644\u0650\u064A\u0651\u064E\u0629\u0650 \u0641\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0643\u0650\u064A\u0646\u064E\u062A\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0623\u064E\u0644\u06E1\u0632\u064E\u0645\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0644\u0650\u0645\u064E\u0629\u064E \u0671\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670 \u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u062D\u064E\u0642\u0651\u064E \u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064E\u0647\u064E\u0627\u06DA \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 27, text: "\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0635\u064E\u062F\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F \u0671\u0644\u0631\u0651\u064F\u0621\u06E1\u064A\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u0644\u064E\u062A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u0650\u062F\u064E \u0671\u0644\u06E1\u062D\u064E\u0631\u064E\u0627\u0645\u064E \u0625\u0650\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0621\u064E\u0627\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0645\u064F\u062D\u064E\u0644\u0651\u0650\u0642\u0650\u064A\u0646\u064E \u0631\u064F\u0621\u064F\u0648\u0633\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064F\u0642\u064E\u0635\u0651\u0650\u0631\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E\u06D6 \u0641\u064E\u0639\u064E\u0644\u0650\u0645\u064E \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u062A\u06E1\u062D\u0657\u0627 \u0642\u064E\u0631\u0650\u064A\u0628\u064B\u0627" }, { id: 28, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0648\u064E\u062F\u0650\u064A\u0646\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u0650\u064A\u064F\u0638\u06E1\u0647\u0650\u0631\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0643\u064F\u0644\u0651\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0643\u064E\u0641\u064E\u0649\u0670 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u0647\u0650\u064A\u062F\u0657\u0627" }, { id: 29, text: "\u0645\u0651\u064F\u062D\u064E\u0645\u0651\u064E\u062F\u065E \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0634\u0650\u062F\u0651\u064E\u0627\u0653\u0621\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u0650 \u0631\u064F\u062D\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06D6 \u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0631\u064F\u0643\u0651\u064E\u0639\u0657\u0627 \u0633\u064F\u062C\u0651\u064E\u062F\u0657\u0627 \u064A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0646\u064E \u0641\u064E\u0636\u06E1\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u0657\u0627\u06D6 \u0633\u0650\u064A\u0645\u064E\u0627\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0648\u064F\u062C\u064F\u0648\u0647\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u062B\u064E\u0631\u0650 \u0671\u0644\u0633\u0651\u064F\u062C\u064F\u0648\u062F\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u062B\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u0650\u06DA \u0648\u064E\u0645\u064E\u062B\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u0650 \u0643\u064E\u0632\u064E\u0631\u06E1\u0639\u064D \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u0634\u064E\u0637\u06E1\u0640\u0654\u064E\u0647\u064F\u06E5 \u0641\u064E\u0640\u0654\u064E\u0627\u0632\u064E\u0631\u064E\u0647\u064F\u06E5 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0644\u064E\u0638\u064E \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064F\u0648\u0642\u0650\u0647\u0650\u06E6 \u064A\u064F\u0639\u06E1\u062C\u0650\u0628\u064F \u0671\u0644\u0632\u0651\u064F\u0631\u0651\u064E\u0627\u0639\u064E \u0644\u0650\u064A\u064E\u063A\u0650\u064A\u0638\u064E \u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064E\u06D7 \u0648\u064E\u0639\u064E\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u0639\u064E\u0638\u0650\u064A\u0645\u064E\u06E2\u0627" }] }, { id: 49, name: "\u0627\u0644\u062D\u062C\u0631\u0627\u062A", transliteration: "Al-Hujurat", type: "medinan", total_verses: 18, verses: [{ id: 1, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064F\u0642\u064E\u062F\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064C \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 2, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0631\u06E1\u0641\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0635\u06E1\u0648\u064E\u0670\u062A\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0648\u06E1\u0642\u064E \u0635\u064E\u0648\u06E1\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0647\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u0643\u064E\u062C\u064E\u0647\u06E1\u0631\u0650 \u0628\u064E\u0639\u06E1\u0636\u0650\u0643\u064F\u0645\u06E1 \u0644\u0650\u0628\u064E\u0639\u06E1\u0636\u064D \u0623\u064E\u0646 \u062A\u064E\u062D\u06E1\u0628\u064E\u0637\u064E \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0634\u06E1\u0639\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u063A\u064F\u0636\u0651\u064F\u0648\u0646\u064E \u0623\u064E\u0635\u06E1\u0648\u064E\u0670\u062A\u064E\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u0645\u06E1\u062A\u064E\u062D\u064E\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064F\u0644\u064F\u0648\u0628\u064E\u0647\u064F\u0645\u06E1 \u0644\u0650\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670\u06DA \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0623\u064E\u062C\u06E1\u0631\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u064C" }, { id: 4, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0646\u064E\u0627\u062F\u064F\u0648\u0646\u064E\u0643\u064E \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u062D\u064F\u062C\u064F\u0631\u064E\u0670\u062A\u0650 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u062E\u06E1\u0631\u064F\u062C\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0644\u064E\u0643\u064E\u0627\u0646\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 6, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0627\u0633\u0650\u0642\u064F\u06E2 \u0628\u0650\u0646\u064E\u0628\u064E\u0625\u0656 \u0641\u064E\u062A\u064E\u0628\u064E\u064A\u0651\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u062A\u064F\u0635\u0650\u064A\u0628\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064E\u06E2\u0627 \u0628\u0650\u062C\u064E\u0647\u064E\u0670\u0644\u064E\u0629\u0656 \u0641\u064E\u062A\u064F\u0635\u06E1\u0628\u0650\u062D\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0641\u064E\u0639\u064E\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0646\u064E\u0670\u062F\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0644\u064E\u0648\u06E1 \u064A\u064F\u0637\u0650\u064A\u0639\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0643\u064E\u062B\u0650\u064A\u0631\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u0650 \u0644\u064E\u0639\u064E\u0646\u0650\u062A\u0651\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062D\u064E\u0628\u0651\u064E\u0628\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064E \u0648\u064E\u0632\u064E\u064A\u0651\u064E\u0646\u064E\u0647\u064F\u06E5 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0643\u064E\u0631\u0651\u064E\u0647\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064F\u0641\u06E1\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0641\u064F\u0633\u064F\u0648\u0642\u064E \u0648\u064E\u0671\u0644\u06E1\u0639\u0650\u0635\u06E1\u064A\u064E\u0627\u0646\u064E\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0634\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u0641\u064E\u0636\u06E1\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u0657\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 9, text: "\u0648\u064E\u0625\u0650\u0646 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u062A\u064E\u0627\u0646\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0671\u0642\u06E1\u062A\u064E\u062A\u064E\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u064E\u0635\u06E1\u0644\u0650\u062D\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627\u06D6 \u0641\u064E\u0625\u0650\u0646\u06E2 \u0628\u064E\u063A\u064E\u062A\u06E1 \u0625\u0650\u062D\u06E1\u062F\u064E\u0649\u0670\u0647\u064F\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670 \u0641\u064E\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062A\u064E\u0628\u06E1\u063A\u0650\u064A \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0641\u0650\u064A\u0653\u0621\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0641\u064E\u0625\u0650\u0646 \u0641\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0641\u064E\u0623\u064E\u0635\u06E1\u0644\u0650\u062D\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u062F\u06E1\u0644\u0650 \u0648\u064E\u0623\u064E\u0642\u06E1\u0633\u0650\u0637\u064F\u0648\u0653\u0627\u0652\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0642\u06E1\u0633\u0650\u0637\u0650\u064A\u0646\u064E" }, { id: 10, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0625\u0650\u062E\u06E1\u0648\u064E\u0629\u065E \u0641\u064E\u0623\u064E\u0635\u06E1\u0644\u0650\u062D\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u062E\u064E\u0648\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0631\u06E1\u062D\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062E\u064E\u0631\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0645\u0651\u0650\u0646 \u0642\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0646\u0650\u0633\u064E\u0627\u0653\u0621\u065E \u0645\u0651\u0650\u0646 \u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064D \u0639\u064E\u0633\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064E\u0643\u064F\u0646\u0651\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0646\u0651\u064E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0644\u06E1\u0645\u0650\u0632\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u064E\u0627\u0628\u064E\u0632\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0642\u064E\u0670\u0628\u0650\u06D6 \u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u0650\u0671\u0633\u06E1\u0645\u064F \u0671\u0644\u06E1\u0641\u064F\u0633\u064F\u0648\u0642\u064F \u0628\u064E\u0639\u06E1\u062F\u064E \u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062A\u064F\u0628\u06E1 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062C\u06E1\u062A\u064E\u0646\u0650\u0628\u064F\u0648\u0627\u0652 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064E\u0646\u0651\u0650 \u0625\u0650\u0646\u0651\u064E \u0628\u064E\u0639\u06E1\u0636\u064E \u0671\u0644\u0638\u0651\u064E\u0646\u0651\u0650 \u0625\u0650\u062B\u06E1\u0645\u065E\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u064E\u0633\u0651\u064E\u0633\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u063A\u06E1\u062A\u064E\u0628 \u0628\u0651\u064E\u0639\u06E1\u0636\u064F\u0643\u064F\u0645 \u0628\u064E\u0639\u06E1\u0636\u064B\u0627\u06DA \u0623\u064E\u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0623\u064E\u062D\u064E\u062F\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064E \u0644\u064E\u062D\u06E1\u0645\u064E \u0623\u064E\u062E\u0650\u064A\u0647\u0650 \u0645\u064E\u064A\u06E1\u062A\u0657\u0627 \u0641\u064E\u0643\u064E\u0631\u0650\u0647\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062A\u064E\u0648\u0651\u064E\u0627\u0628\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 13, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0625\u0650\u0646\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0630\u064E\u0643\u064E\u0631\u0656 \u0648\u064E\u0623\u064F\u0646\u062B\u064E\u0649\u0670 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0634\u064F\u0639\u064F\u0648\u0628\u0657\u0627 \u0648\u064E\u0642\u064E\u0628\u064E\u0627\u0653\u0626\u0650\u0644\u064E \u0644\u0650\u062A\u064E\u0639\u064E\u0627\u0631\u064E\u0641\u064F\u0648\u0653\u0627\u0652\u06DA \u0625\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u0631\u064E\u0645\u064E\u0643\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u062A\u06E1\u0642\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 14, text: "\u06DE\u0642\u064E\u0627\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0631\u064E\u0627\u0628\u064F \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627\u06D6 \u0642\u064F\u0644 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0642\u064F\u0648\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u06E1\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u0650 \u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064F \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064F\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0644\u064E\u0627 \u064A\u064E\u0644\u0650\u062A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 15, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u06E1\u062A\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u062C\u064E\u0670\u0647\u064E\u062F\u064F\u0648\u0627\u0652 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u062A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u062F\u0650\u064A\u0646\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 17, text: "\u064A\u064E\u0645\u064F\u0646\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0623\u064E\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u064F\u0648\u0627\u0652\u06D6 \u0642\u064F\u0644 \u0644\u0651\u064E\u0627 \u062A\u064E\u0645\u064F\u0646\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u0651\u064E \u0625\u0650\u0633\u06E1\u0644\u064E\u0670\u0645\u064E\u0643\u064F\u0645\u06D6 \u0628\u064E\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0645\u064F\u0646\u0651\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u06E1 \u0647\u064E\u062F\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0644\u0650\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u063A\u064E\u064A\u06E1\u0628\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u0635\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }] }, { id: 50, name: "\u0642", transliteration: "Qaf", type: "meccan", total_verses: 45, verses: [{ id: 1, text: "\u0642\u0653\u06DA \u0648\u064E\u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0671\u0644\u06E1\u0645\u064E\u062C\u0650\u064A\u062F\u0650" }, { id: 2, text: "\u0628\u064E\u0644\u06E1 \u0639\u064E\u062C\u0650\u0628\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0646\u0630\u0650\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0634\u064E\u064A\u06E1\u0621\u064C \u0639\u064E\u062C\u0650\u064A\u0628\u064C" }, { id: 3, text: "\u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0645\u0650\u062A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u062A\u064F\u0631\u064E\u0627\u0628\u0657\u0627\u06D6 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0631\u064E\u062C\u06E1\u0639\u064F\u06E2 \u0628\u064E\u0639\u0650\u064A\u062F\u065E" }, { id: 4, text: "\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u062A\u064E\u0646\u0642\u064F\u0635\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0639\u0650\u0646\u062F\u064E\u0646\u064E\u0627 \u0643\u0650\u062A\u064E\u0670\u0628\u064C \u062D\u064E\u0641\u0650\u064A\u0638\u064F\u06E2" }, { id: 5, text: "\u0628\u064E\u0644\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1\u0631\u0656 \u0645\u0651\u064E\u0631\u0650\u064A\u062C\u064D" }, { id: 6, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0641\u064E\u0648\u06E1\u0642\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u0628\u064E\u0646\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0648\u064E\u0632\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0640\u0670\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064E\u0627 \u0645\u0650\u0646 \u0641\u064F\u0631\u064F\u0648\u062C\u0656" }, { id: 7, text: "\u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0645\u064E\u062F\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u064A\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0631\u064E\u0648\u064E\u0670\u0633\u0650\u064A\u064E \u0648\u064E\u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0632\u064E\u0648\u06E1\u062C\u0650\u06ED \u0628\u064E\u0647\u0650\u064A\u062C\u0656" }, { id: 8, text: "\u062A\u064E\u0628\u06E1\u0635\u0650\u0631\u064E\u0629\u0657 \u0648\u064E\u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0639\u064E\u0628\u06E1\u062F\u0656 \u0645\u0651\u064F\u0646\u0650\u064A\u0628\u0656" }, { id: 9, text: "\u0648\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u0645\u0651\u064F\u0628\u064E\u0670\u0631\u064E\u0643\u0657\u0627 \u0641\u064E\u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u062D\u064E\u0628\u0651\u064E \u0671\u0644\u06E1\u062D\u064E\u0635\u0650\u064A\u062F\u0650" }, { id: 10, text: "\u0648\u064E\u0671\u0644\u0646\u0651\u064E\u062E\u06E1\u0644\u064E \u0628\u064E\u0627\u0633\u0650\u0642\u064E\u0670\u062A\u0656 \u0644\u0651\u064E\u0647\u064E\u0627 \u0637\u064E\u0644\u06E1\u0639\u065E \u0646\u0651\u064E\u0636\u0650\u064A\u062F\u065E" }, { id: 11, text: "\u0631\u0651\u0650\u0632\u06E1\u0642\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0639\u0650\u0628\u064E\u0627\u062F\u0650\u06D6 \u0648\u064E\u0623\u064E\u062D\u06E1\u064A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0628\u064E\u0644\u06E1\u062F\u064E\u0629\u0657 \u0645\u0651\u064E\u064A\u06E1\u062A\u0657\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u062E\u064F\u0631\u064F\u0648\u062C\u064F" }, { id: 12, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064F \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0631\u0651\u064E\u0633\u0651\u0650 \u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064F" }, { id: 13, text: "\u0648\u064E\u0639\u064E\u0627\u062F\u065E \u0648\u064E\u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0648\u064E\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u064F \u0644\u064F\u0648\u0637\u0656" }, { id: 14, text: "\u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u0623\u064E\u064A\u06E1\u0643\u064E\u0629\u0650 \u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064F \u062A\u064F\u0628\u0651\u064E\u0639\u0656\u06DA \u0643\u064F\u0644\u0651\u065E \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064E \u0641\u064E\u062D\u064E\u0642\u0651\u064E \u0648\u064E\u0639\u0650\u064A\u062F\u0650" }, { id: 15, text: "\u0623\u064E\u0641\u064E\u0639\u064E\u064A\u0650\u064A\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u062E\u064E\u0644\u06E1\u0642\u0650 \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0644\u064E\u0628\u06E1\u0633\u0656 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0642\u0656 \u062C\u064E\u062F\u0650\u064A\u062F\u0656" }, { id: 16, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0648\u064E\u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064F\u0648\u064E\u0633\u06E1\u0648\u0650\u0633\u064F \u0628\u0650\u0647\u0650\u06E6 \u0646\u064E\u0641\u06E1\u0633\u064F\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E1 \u062D\u064E\u0628\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0648\u064E\u0631\u0650\u064A\u062F\u0650" }, { id: 17, text: "\u0625\u0650\u0630\u06E1 \u064A\u064E\u062A\u064E\u0644\u064E\u0642\u0651\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0644\u064E\u0642\u0651\u0650\u064A\u064E\u0627\u0646\u0650 \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650 \u0648\u064E\u0639\u064E\u0646\u0650 \u0671\u0644\u0634\u0651\u0650\u0645\u064E\u0627\u0644\u0650 \u0642\u064E\u0639\u0650\u064A\u062F\u065E" }, { id: 18, text: "\u0645\u0651\u064E\u0627 \u064A\u064E\u0644\u06E1\u0641\u0650\u0638\u064F \u0645\u0650\u0646 \u0642\u064E\u0648\u06E1\u0644\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0631\u064E\u0642\u0650\u064A\u0628\u064C \u0639\u064E\u062A\u0650\u064A\u062F\u065E" }, { id: 19, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0633\u064E\u0643\u06E1\u0631\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u0650 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06D6 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u062A\u064E\u062D\u0650\u064A\u062F\u064F" }, { id: 20, text: "\u0648\u064E\u0646\u064F\u0641\u0650\u062E\u064E \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u0648\u0631\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u0648\u064E\u0639\u0650\u064A\u062F\u0650" }, { id: 21, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0645\u0651\u064E\u0639\u064E\u0647\u064E\u0627 \u0633\u064E\u0627\u0653\u0626\u0650\u0642\u065E \u0648\u064E\u0634\u064E\u0647\u0650\u064A\u062F\u065E" }, { id: 22, text: "\u0644\u0651\u064E\u0642\u064E\u062F\u06E1 \u0643\u064F\u0646\u062A\u064E \u0641\u0650\u064A \u063A\u064E\u0641\u06E1\u0644\u064E\u0629\u0656 \u0645\u0651\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0641\u064E\u0643\u064E\u0634\u064E\u0641\u06E1\u0646\u064E\u0627 \u0639\u064E\u0646\u0643\u064E \u063A\u0650\u0637\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0641\u064E\u0628\u064E\u0635\u064E\u0631\u064F\u0643\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u062D\u064E\u062F\u0650\u064A\u062F\u065E" }, { id: 23, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0642\u064E\u0631\u0650\u064A\u0646\u064F\u0647\u064F\u06E5 \u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u064E\u0627 \u0644\u064E\u062F\u064E\u064A\u0651\u064E \u0639\u064E\u062A\u0650\u064A\u062F\u064C" }, { id: 24, text: "\u0623\u064E\u0644\u06E1\u0642\u0650\u064A\u064E\u0627 \u0641\u0650\u064A \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0643\u064F\u0644\u0651\u064E \u0643\u064E\u0641\u0651\u064E\u0627\u0631\u064D \u0639\u064E\u0646\u0650\u064A\u062F\u0656" }, { id: 25, text: "\u0645\u0651\u064E\u0646\u0651\u064E\u0627\u0639\u0656 \u0644\u0651\u0650\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650 \u0645\u064F\u0639\u06E1\u062A\u064E\u062F\u0656 \u0645\u0651\u064F\u0631\u0650\u064A\u0628\u064D" }, { id: 26, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u064E \u0641\u064E\u0623\u064E\u0644\u06E1\u0642\u0650\u064A\u064E\u0627\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0671\u0644\u0634\u0651\u064E\u062F\u0650\u064A\u062F\u0650" }, { id: 27, text: "\u06DE\u0642\u064E\u0627\u0644\u064E \u0642\u064E\u0631\u0650\u064A\u0646\u064F\u0647\u064F\u06E5 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0645\u064E\u0627\u0653 \u0623\u064E\u0637\u06E1\u063A\u064E\u064A\u06E1\u062A\u064F\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0650\u06ED \u0628\u064E\u0639\u0650\u064A\u062F\u0656" }, { id: 28, text: "\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0627 \u062A\u064E\u062E\u06E1\u062A\u064E\u0635\u0650\u0645\u064F\u0648\u0627\u0652 \u0644\u064E\u062F\u064E\u064A\u0651\u064E \u0648\u064E\u0642\u064E\u062F\u06E1 \u0642\u064E\u062F\u0651\u064E\u0645\u06E1\u062A\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0648\u064E\u0639\u0650\u064A\u062F\u0650" }, { id: 29, text: "\u0645\u064E\u0627 \u064A\u064F\u0628\u064E\u062F\u0651\u064E\u0644\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u064F \u0644\u064E\u062F\u064E\u064A\u0651\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0628\u0650\u0638\u064E\u0644\u0651\u064E\u0640\u0670\u0645\u0656 \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0628\u0650\u064A\u062F\u0650" }, { id: 30, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0646\u064E\u0642\u064F\u0648\u0644\u064F \u0644\u0650\u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0647\u064E\u0644\u0650 \u0671\u0645\u06E1\u062A\u064E\u0644\u064E\u0623\u06E1\u062A\u0650 \u0648\u064E\u062A\u064E\u0642\u064F\u0648\u0644\u064F \u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0645\u0651\u064E\u0632\u0650\u064A\u062F\u0656" }, { id: 31, text: "\u0648\u064E\u0623\u064F\u0632\u06E1\u0644\u0650\u0641\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064F \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u063A\u064E\u064A\u06E1\u0631\u064E \u0628\u064E\u0639\u0650\u064A\u062F\u064D" }, { id: 32, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u064E\u0627 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0623\u064E\u0648\u0651\u064E\u0627\u0628\u064D \u062D\u064E\u0641\u0650\u064A\u0638\u0656" }, { id: 33, text: "\u0645\u0651\u064E\u0646\u06E1 \u062E\u064E\u0634\u0650\u064A\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0642\u064E\u0644\u06E1\u0628\u0656 \u0645\u0651\u064F\u0646\u0650\u064A\u0628\u064D" }, { id: 34, text: "\u0671\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0647\u064E\u0627 \u0628\u0650\u0633\u064E\u0644\u064E\u0670\u0645\u0656\u06D6 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u062E\u064F\u0644\u064F\u0648\u062F\u0650" }, { id: 35, text: "\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627 \u0645\u064E\u0632\u0650\u064A\u062F\u065E" }, { id: 36, text: "\u0648\u064E\u0643\u064E\u0645\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u0646\u064D \u0647\u064F\u0645\u06E1 \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0628\u064E\u0637\u06E1\u0634\u0657\u0627 \u0641\u064E\u0646\u064E\u0642\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u0650\u0644\u064E\u0670\u062F\u0650 \u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0645\u0651\u064E\u062D\u0650\u064A\u0635\u064D" }, { id: 37, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0642\u064E\u0644\u06E1\u0628\u064C \u0623\u064E\u0648\u06E1 \u0623\u064E\u0644\u06E1\u0642\u064E\u0649 \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u064E \u0648\u064E\u0647\u064F\u0648\u064E \u0634\u064E\u0647\u0650\u064A\u062F\u065E" }, { id: 38, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0641\u0650\u064A \u0633\u0650\u062A\u0651\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u0648\u064E\u0645\u064E\u0627 \u0645\u064E\u0633\u0651\u064E\u0646\u064E\u0627 \u0645\u0650\u0646 \u0644\u0651\u064F\u063A\u064F\u0648\u0628\u0656" }, { id: 39, text: "\u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0642\u064E\u0628\u06E1\u0644\u064E \u0637\u064F\u0644\u064F\u0648\u0639\u0650 \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u0650 \u0648\u064E\u0642\u064E\u0628\u06E1\u0644\u064E \u0671\u0644\u06E1\u063A\u064F\u0631\u064F\u0648\u0628\u0650" }, { id: 40, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0641\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1\u0647\u064F \u0648\u064E\u0623\u064E\u062F\u06E1\u0628\u064E\u0670\u0631\u064E \u0671\u0644\u0633\u0651\u064F\u062C\u064F\u0648\u062F\u0650" }, { id: 41, text: "\u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0646\u064E\u0627\u062F\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0627\u062F\u0650 \u0645\u0650\u0646 \u0645\u0651\u064E\u0643\u064E\u0627\u0646\u0656 \u0642\u064E\u0631\u0650\u064A\u0628\u0656" }, { id: 42, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u062D\u064E\u0629\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u062E\u064F\u0631\u064F\u0648\u062C\u0650" }, { id: 43, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0646\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u0646\u064F\u0645\u0650\u064A\u062A\u064F \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 44, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0634\u064E\u0642\u0651\u064E\u0642\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0633\u0650\u0631\u064E\u0627\u0639\u0657\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062D\u064E\u0634\u06E1\u0631\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u064A\u064E\u0633\u0650\u064A\u0631\u065E" }, { id: 45, text: "\u0646\u0651\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E\u06D6 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u062C\u064E\u0628\u0651\u064E\u0627\u0631\u0656\u06D6 \u0641\u064E\u0630\u064E\u0643\u0651\u0650\u0631\u06E1 \u0628\u0650\u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650 \u0645\u064E\u0646 \u064A\u064E\u062E\u064E\u0627\u0641\u064F \u0648\u064E\u0639\u0650\u064A\u062F\u0650" }] }, { id: 51, name: "\u0627\u0644\u0630\u0627\u0631\u064A\u0627\u062A", transliteration: "Adh-Dhariyat", type: "meccan", total_verses: 60, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u0630\u0651\u064E\u0640\u0670\u0631\u0650\u064A\u064E\u0670\u062A\u0650 \u0630\u064E\u0631\u06E1\u0648\u0657\u0627" }, { id: 2, text: "\u0641\u064E\u0671\u0644\u06E1\u062D\u064E\u0670\u0645\u0650\u0644\u064E\u0670\u062A\u0650 \u0648\u0650\u0642\u06E1\u0631\u0657\u0627" }, { id: 3, text: "\u0641\u064E\u0671\u0644\u06E1\u062C\u064E\u0670\u0631\u0650\u064A\u064E\u0670\u062A\u0650 \u064A\u064F\u0633\u06E1\u0631\u0657\u0627" }, { id: 4, text: "\u0641\u064E\u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0633\u0651\u0650\u0645\u064E\u0670\u062A\u0650 \u0623\u064E\u0645\u06E1\u0631\u064B\u0627" }, { id: 5, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E \u0644\u064E\u0635\u064E\u0627\u062F\u0650\u0642\u065E" }, { id: 6, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E \u0644\u064E\u0648\u064E\u0670\u0642\u0650\u0639\u065E" }, { id: 7, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u06E1\u062D\u064F\u0628\u064F\u0643\u0650" }, { id: 8, text: "\u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0641\u0650\u064A \u0642\u064E\u0648\u06E1\u0644\u0656 \u0645\u0651\u064F\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u0656" }, { id: 9, text: "\u064A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F \u0639\u064E\u0646\u06E1\u0647\u064F \u0645\u064E\u0646\u06E1 \u0623\u064F\u0641\u0650\u0643\u064E" }, { id: 10, text: "\u0642\u064F\u062A\u0650\u0644\u064E \u0671\u0644\u06E1\u062E\u064E\u0631\u0651\u064E\u0640\u0670\u0635\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u063A\u064E\u0645\u06E1\u0631\u064E\u0629\u0656 \u0633\u064E\u0627\u0647\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u064A\u0651\u064E\u0627\u0646\u064E \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 13, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u064A\u064F\u0641\u06E1\u062A\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0641\u0650\u062A\u06E1\u0646\u064E\u062A\u064E\u0643\u064F\u0645\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u0639\u064F\u064A\u064F\u0648\u0646\u064D" }, { id: 16, text: "\u0621\u064E\u0627\u062E\u0650\u0630\u0650\u064A\u0646\u064E \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0628\u06E1\u0644\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0645\u064E\u0627 \u064A\u064E\u0647\u06E1\u062C\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u0628\u0650\u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u062D\u064E\u0627\u0631\u0650 \u0647\u064F\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u0641\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u0642\u0651\u065E \u0644\u0651\u0650\u0644\u0633\u0651\u064E\u0627\u0653\u0626\u0650\u0644\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u062D\u06E1\u0631\u064F\u0648\u0645\u0650" }, { id: 20, text: "\u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u065E \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0648\u0642\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1\u06DA \u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0631\u0650\u0632\u06E1\u0642\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0641\u064E\u0648\u064E\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u062D\u064E\u0642\u0651\u065E \u0645\u0651\u0650\u062B\u06E1\u0644\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0646\u0637\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0647\u064E\u0644\u06E1 \u0623\u064E\u062A\u064E\u0649\u0670\u0643\u064E \u062D\u064E\u062F\u0650\u064A\u062B\u064F \u0636\u064E\u064A\u06E1\u0641\u0650 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0671\u0644\u06E1\u0645\u064F\u0643\u06E1\u0631\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 25, text: "\u0625\u0650\u0630\u06E1 \u062F\u064E\u062E\u064E\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0644\u064E\u0670\u0645\u0657\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0633\u064E\u0644\u064E\u0670\u0645\u065E \u0642\u064E\u0648\u06E1\u0645\u065E \u0645\u0651\u064F\u0646\u0643\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0641\u064E\u0631\u064E\u0627\u063A\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0628\u0650\u0639\u0650\u062C\u06E1\u0644\u0656 \u0633\u064E\u0645\u0650\u064A\u0646\u0656" }, { id: 27, text: "\u0641\u064E\u0642\u064E\u0631\u0651\u064E\u0628\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0641\u064E\u0623\u064E\u0648\u06E1\u062C\u064E\u0633\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u062E\u0650\u064A\u0641\u064E\u0629\u0657\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062E\u064E\u0641\u06E1\u06D6 \u0648\u064E\u0628\u064E\u0634\u0651\u064E\u0631\u064F\u0648\u0647\u064F \u0628\u0650\u063A\u064F\u0644\u064E\u0670\u0645\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 29, text: "\u0641\u064E\u0623\u064E\u0642\u06E1\u0628\u064E\u0644\u064E\u062A\u0650 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A \u0635\u064E\u0631\u0651\u064E\u0629\u0656 \u0641\u064E\u0635\u064E\u0643\u0651\u064E\u062A\u06E1 \u0648\u064E\u062C\u06E1\u0647\u064E\u0647\u064E\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0639\u064E\u062C\u064F\u0648\u0632\u064C \u0639\u064E\u0642\u0650\u064A\u0645\u065E" }, { id: 30, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u0650 \u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u0650\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F" }, { id: 31, text: "\u06DE\u0642\u064E\u0627\u0644\u064E \u0641\u064E\u0645\u064E\u0627 \u062E\u064E\u0637\u06E1\u0628\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0656 \u0645\u0651\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 33, text: "\u0644\u0650\u0646\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062D\u0650\u062C\u064E\u0627\u0631\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0637\u0650\u064A\u0646\u0656" }, { id: 34, text: "\u0645\u0651\u064F\u0633\u064E\u0648\u0651\u064E\u0645\u064E\u0629\u064B \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u0650\u0644\u06E1\u0645\u064F\u0633\u06E1\u0631\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 35, text: "\u0641\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u06E1\u0646\u064E\u0627 \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 36, text: "\u0641\u064E\u0645\u064E\u0627 \u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E \u0628\u064E\u064A\u06E1\u062A\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 37, text: "\u0648\u064E\u062A\u064E\u0631\u064E\u0643\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u0623\u064E\u0644\u0650\u064A\u0645\u064E" }, { id: 38, text: "\u0648\u064E\u0641\u0650\u064A \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0628\u0650\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 39, text: "\u0641\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0628\u0650\u0631\u064F\u0643\u06E1\u0646\u0650\u0647\u0650\u06E6 \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0633\u064E\u0670\u062D\u0650\u0631\u064C \u0623\u064E\u0648\u06E1 \u0645\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u065E" }, { id: 40, text: "\u0641\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F \u0648\u064E\u062C\u064F\u0646\u064F\u0648\u062F\u064E\u0647\u064F\u06E5 \u0641\u064E\u0646\u064E\u0628\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u064A\u064E\u0645\u0651\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064F\u0644\u0650\u064A\u0645\u065E" }, { id: 41, text: "\u0648\u064E\u0641\u0650\u064A \u0639\u064E\u0627\u062F\u064D \u0625\u0650\u0630\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0631\u0651\u0650\u064A\u062D\u064E \u0671\u0644\u06E1\u0639\u064E\u0642\u0650\u064A\u0645\u064E" }, { id: 42, text: "\u0645\u064E\u0627 \u062A\u064E\u0630\u064E\u0631\u064F \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D \u0623\u064E\u062A\u064E\u062A\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E\u062A\u06E1\u0647\u064F \u0643\u064E\u0671\u0644\u0631\u0651\u064E\u0645\u0650\u064A\u0645\u0650" }, { id: 43, text: "\u0648\u064E\u0641\u0650\u064A \u062B\u064E\u0645\u064F\u0648\u062F\u064E \u0625\u0650\u0630\u06E1 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062D\u0650\u064A\u0646\u0656" }, { id: 44, text: "\u0641\u064E\u0639\u064E\u062A\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0639\u0650\u0642\u064E\u0629\u064F \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0641\u064E\u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0670\u0639\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u0650\u064A\u064E\u0627\u0645\u0656 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u064F\u0646\u062A\u064E\u0635\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064E \u0646\u064F\u0648\u062D\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0628\u064E\u0646\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0628\u0650\u0623\u064E\u064A\u06E1\u064A\u0652\u062F\u0656 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064F\u0648\u0633\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0641\u064E\u0631\u064E\u0634\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0641\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u06E1\u0645\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0632\u064E\u0648\u06E1\u062C\u064E\u064A\u06E1\u0646\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 50, text: "\u0641\u064E\u0641\u0650\u0631\u0651\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 51, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u0670\u0647\u064B\u0627 \u0621\u064E\u0627\u062E\u064E\u0631\u064E\u06D6 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 52, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u062A\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u0627\u062D\u0650\u0631\u064C \u0623\u064E\u0648\u06E1 \u0645\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u064C" }, { id: 53, text: "\u0623\u064E\u062A\u064E\u0648\u064E\u0627\u0635\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u06DA \u0628\u064E\u0644\u06E1 \u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0637\u064E\u0627\u063A\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u0641\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0628\u0650\u0645\u064E\u0644\u064F\u0648\u0645\u0656" }, { id: 55, text: "\u0648\u064E\u0630\u064E\u0643\u0651\u0650\u0631\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u062A\u064E\u0646\u0641\u064E\u0639\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 56, text: "\u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064F \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064E \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u0650" }, { id: 57, text: "\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u0650\u064A\u062F\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u0650\u0632\u06E1\u0642\u0656 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u0650\u064A\u062F\u064F \u0623\u064E\u0646 \u064A\u064F\u0637\u06E1\u0639\u0650\u0645\u064F\u0648\u0646\u0650" }, { id: 58, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u0631\u0651\u064E\u0632\u0651\u064E\u0627\u0642\u064F \u0630\u064F\u0648 \u0671\u0644\u06E1\u0642\u064F\u0648\u0651\u064E\u0629\u0650 \u0671\u0644\u06E1\u0645\u064E\u062A\u0650\u064A\u0646\u064F" }, { id: 59, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0630\u064E\u0646\u064F\u0648\u0628\u0657\u0627 \u0645\u0651\u0650\u062B\u06E1\u0644\u064E \u0630\u064E\u0646\u064F\u0648\u0628\u0650 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0639\u06E1\u062C\u0650\u0644\u064F\u0648\u0646\u0650" }, { id: 60, text: "\u0641\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u064A\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }] }, { id: 52, name: "\u0627\u0644\u0637\u0648\u0631", transliteration: "At-Tur", type: "meccan", total_verses: 49, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u0637\u0651\u064F\u0648\u0631\u0650" }, { id: 2, text: "\u0648\u064E\u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u064E\u0633\u06E1\u0637\u064F\u0648\u0631\u0656" }, { id: 3, text: "\u0641\u0650\u064A \u0631\u064E\u0642\u0651\u0656 \u0645\u0651\u064E\u0646\u0634\u064F\u0648\u0631\u0656" }, { id: 4, text: "\u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u0650 \u0671\u0644\u06E1\u0645\u064E\u0639\u06E1\u0645\u064F\u0648\u0631\u0650" }, { id: 5, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0642\u06E1\u0641\u0650 \u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u0641\u064F\u0648\u0639\u0650" }, { id: 6, text: "\u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0671\u0644\u06E1\u0645\u064E\u0633\u06E1\u062C\u064F\u0648\u0631\u0650" }, { id: 7, text: "\u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0648\u064E\u0670\u0642\u0650\u0639\u065E" }, { id: 8, text: "\u0645\u0651\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u062F\u064E\u0627\u0641\u0650\u0639\u0656" }, { id: 9, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0645\u064F\u0648\u0631\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0645\u064E\u0648\u06E1\u0631\u0657\u0627" }, { id: 10, text: "\u0648\u064E\u062A\u064E\u0633\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0633\u064E\u064A\u06E1\u0631\u0657\u0627" }, { id: 11, text: "\u0641\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 12, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u062E\u064E\u0648\u06E1\u0636\u0656 \u064A\u064E\u0644\u06E1\u0639\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u062F\u064E\u0639\u0651\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0646\u064E\u0627\u0631\u0650 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062F\u064E\u0639\u0651\u064B\u0627" }, { id: 14, text: "\u0647\u064E\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0623\u064E\u0641\u064E\u0633\u0650\u062D\u06E1\u0631\u064C \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0671\u0635\u06E1\u0644\u064E\u0648\u06E1\u0647\u064E\u0627 \u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0648\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0635\u06E1\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06D6 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u0646\u064E\u0639\u0650\u064A\u0645\u0656" }, { id: 18, text: "\u0641\u064E\u0670\u0643\u0650\u0647\u0650\u064A\u0646\u064E \u0628\u0650\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0648\u064E\u0642\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 19, text: "\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0634\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0647\u064E\u0646\u0650\u064A\u0653\u0640\u0654\u064E\u06E2\u0627 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0645\u064F\u062A\u0651\u064E\u0643\u0650\u0640\u0654\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064F\u0631\u064F\u0631\u0656 \u0645\u0651\u064E\u0635\u06E1\u0641\u064F\u0648\u0641\u064E\u0629\u0656\u06D6 \u0648\u064E\u0632\u064E\u0648\u0651\u064E\u062C\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u062D\u064F\u0648\u0631\u064D \u0639\u0650\u064A\u0646\u0656" }, { id: 21, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064E\u062A\u06E1\u0647\u064F\u0645\u06E1 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u064F\u0647\u064F\u0645 \u0628\u0650\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064D \u0623\u064E\u0644\u06E1\u062D\u064E\u0642\u06E1\u0646\u064E\u0627 \u0628\u0650\u0647\u0650\u0645\u06E1 \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0644\u064E\u062A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0645\u064E\u0644\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06DA \u0643\u064F\u0644\u0651\u064F \u0671\u0645\u06E1\u0631\u0650\u064A\u0655\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E \u0631\u064E\u0647\u0650\u064A\u0646\u065E" }, { id: 22, text: "\u0648\u064E\u0623\u064E\u0645\u06E1\u062F\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u062D\u06E1\u0645\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0634\u06E1\u062A\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u064A\u064E\u062A\u064E\u0646\u064E\u0670\u0632\u064E\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0643\u064E\u0623\u06E1\u0633\u0657\u0627 \u0644\u0651\u064E\u0627 \u0644\u064E\u063A\u06E1\u0648\u065E \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u062B\u0650\u064A\u0645\u065E" }, { id: 24, text: "\u06DE\u0648\u064E\u064A\u064E\u0637\u064F\u0648\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u063A\u0650\u0644\u06E1\u0645\u064E\u0627\u0646\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064F\u0624\u06E1\u0644\u064F\u0624\u065E \u0645\u0651\u064E\u0643\u06E1\u0646\u064F\u0648\u0646\u065E" }, { id: 25, text: "\u0648\u064E\u0623\u064E\u0642\u06E1\u0628\u064E\u0644\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u064A\u064E\u062A\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 26, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0642\u064E\u0628\u06E1\u0644\u064F \u0641\u0650\u064A\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0646\u064E\u0627 \u0645\u064F\u0634\u06E1\u0641\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 27, text: "\u0641\u064E\u0645\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0648\u064E\u0642\u064E\u0649\u0670\u0646\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064F\u0648\u0645\u0650" }, { id: 28, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0646\u064E\u062F\u06E1\u0639\u064F\u0648\u0647\u064F\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0628\u064E\u0631\u0651\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 29, text: "\u0641\u064E\u0630\u064E\u0643\u0651\u0650\u0631\u06E1 \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0628\u0650\u0646\u0650\u0639\u06E1\u0645\u064E\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0628\u0650\u0643\u064E\u0627\u0647\u0650\u0646\u0656 \u0648\u064E\u0644\u064E\u0627 \u0645\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u064D" }, { id: 30, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0634\u064E\u0627\u0639\u0650\u0631\u065E \u0646\u0651\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u064F \u0628\u0650\u0647\u0650\u06E6 \u0631\u064E\u064A\u06E1\u0628\u064E \u0671\u0644\u06E1\u0645\u064E\u0646\u064F\u0648\u0646\u0650" }, { id: 31, text: "\u0642\u064F\u0644\u06E1 \u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0645\u064E\u0639\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0631\u064E\u0628\u0651\u0650\u0635\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0623\u064E\u0645\u06E1 \u062A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u062D\u06E1\u0644\u064E\u0670\u0645\u064F\u0647\u064F\u0645 \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627\u0653\u06DA \u0623\u064E\u0645\u06E1 \u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0637\u064E\u0627\u063A\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u062A\u064E\u0642\u064E\u0648\u0651\u064E\u0644\u064E\u0647\u064F\u06E5\u06DA \u0628\u064E\u0644 \u0644\u0651\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0641\u064E\u0644\u06E1\u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u062D\u064E\u062F\u0650\u064A\u062B\u0656 \u0645\u0651\u0650\u062B\u06E1\u0644\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 35, text: "\u0623\u064E\u0645\u06E1 \u062E\u064F\u0644\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u063A\u064E\u064A\u06E1\u0631\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0623\u064E\u0645\u06E1 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0644\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0623\u064E\u0645\u06E1 \u062E\u064E\u0644\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E\u06DA \u0628\u064E\u0644 \u0644\u0651\u064E\u0627 \u064A\u064F\u0648\u0642\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0623\u064E\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u0645\u06E1 \u062E\u064E\u0632\u064E\u0627\u0653\u0626\u0650\u0646\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0623\u064E\u0645\u06E1 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0635\u06DC\u064E\u064A\u06E1\u0637\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0633\u064F\u0644\u0651\u064E\u0645\u065E \u064A\u064E\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u0650\u06D6 \u0641\u064E\u0644\u06E1\u064A\u064E\u0623\u06E1\u062A\u0650 \u0645\u064F\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u064F\u0647\u064F\u0645 \u0628\u0650\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064D" }, { id: 39, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0628\u064E\u0646\u064E\u0670\u062A\u064F \u0648\u064E\u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u0646\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0623\u064E\u0645\u06E1 \u062A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0657\u0627 \u0641\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u063A\u06E1\u0631\u064E\u0645\u0656 \u0645\u0651\u064F\u062B\u06E1\u0642\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 41, text: "\u0623\u064E\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u064F \u0641\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0643\u06E1\u062A\u064F\u0628\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0623\u064E\u0645\u06E1 \u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0643\u064E\u064A\u06E1\u062F\u0657\u0627\u06D6 \u0641\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0643\u0650\u064A\u062F\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0670\u0647\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0643\u0650\u0633\u06E1\u0641\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0633\u064E\u0627\u0642\u0650\u0637\u0657\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0633\u064E\u062D\u064E\u0627\u0628\u065E \u0645\u0651\u064E\u0631\u06E1\u0643\u064F\u0648\u0645\u065E" }, { id: 45, text: "\u0641\u064E\u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0644\u064E\u0670\u0642\u064F\u0648\u0627\u0652 \u064A\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0641\u0650\u064A\u0647\u0650 \u064A\u064F\u0635\u06E1\u0639\u064E\u0642\u064F\u0648\u0646\u064E" }, { id: 46, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0643\u064E\u064A\u06E1\u062F\u064F\u0647\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0638\u064E\u0644\u064E\u0645\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u062F\u064F\u0648\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0644\u0650\u062D\u064F\u0643\u06E1\u0645\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0628\u0650\u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0650\u0646\u064E\u0627\u06D6 \u0648\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u062D\u0650\u064A\u0646\u064E \u062A\u064E\u0642\u064F\u0648\u0645\u064F" }, { id: 49, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0641\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1\u0647\u064F \u0648\u064E\u0625\u0650\u062F\u06E1\u0628\u064E\u0670\u0631\u064E \u0671\u0644\u0646\u0651\u064F\u062C\u064F\u0648\u0645\u0650" }] }, { id: 53, name: "\u0627\u0644\u0646\u062C\u0645", transliteration: "An-Najm", type: "meccan", total_verses: 62, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u0646\u0651\u064E\u062C\u06E1\u0645\u0650 \u0625\u0650\u0630\u064E\u0627 \u0647\u064E\u0648\u064E\u0649\u0670" }, { id: 2, text: "\u0645\u064E\u0627 \u0636\u064E\u0644\u0651\u064E \u0635\u064E\u0627\u062D\u0650\u0628\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u063A\u064E\u0648\u064E\u0649\u0670" }, { id: 3, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0646\u0637\u0650\u0642\u064F \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0647\u064E\u0648\u064E\u0649\u0670\u0653" }, { id: 4, text: "\u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u062D\u06E1\u064A\u065E \u064A\u064F\u0648\u062D\u064E\u0649\u0670" }, { id: 5, text: "\u0639\u064E\u0644\u0651\u064E\u0645\u064E\u0647\u064F\u06E5 \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0642\u064F\u0648\u064E\u0649\u0670" }, { id: 6, text: "\u0630\u064F\u0648 \u0645\u0650\u0631\u0651\u064E\u0629\u0656 \u0641\u064E\u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670" }, { id: 7, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u064F\u0641\u064F\u0642\u0650 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0649\u0670" }, { id: 8, text: "\u062B\u064F\u0645\u0651\u064E \u062F\u064E\u0646\u064E\u0627 \u0641\u064E\u062A\u064E\u062F\u064E\u0644\u0651\u064E\u0649\u0670" }, { id: 9, text: "\u0641\u064E\u0643\u064E\u0627\u0646\u064E \u0642\u064E\u0627\u0628\u064E \u0642\u064E\u0648\u06E1\u0633\u064E\u064A\u06E1\u0646\u0650 \u0623\u064E\u0648\u06E1 \u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670" }, { id: 10, text: "\u0641\u064E\u0623\u064E\u0648\u06E1\u062D\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0628\u06E1\u062F\u0650\u0647\u0650\u06E6 \u0645\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u062D\u064E\u0649\u0670" }, { id: 11, text: "\u0645\u064E\u0627 \u0643\u064E\u0630\u064E\u0628\u064E \u0671\u0644\u06E1\u0641\u064F\u0624\u064E\u0627\u062F\u064F \u0645\u064E\u0627 \u0631\u064E\u0623\u064E\u0649\u0670\u0653" }, { id: 12, text: "\u0623\u064E\u0641\u064E\u062A\u064F\u0645\u064E\u0670\u0631\u064F\u0648\u0646\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u064A\u064E\u0631\u064E\u0649\u0670" }, { id: 13, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0631\u064E\u0621\u064E\u0627\u0647\u064F \u0646\u064E\u0632\u06E1\u0644\u064E\u0629\u064B \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670" }, { id: 14, text: "\u0639\u0650\u0646\u062F\u064E \u0633\u0650\u062F\u06E1\u0631\u064E\u0629\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u062A\u064E\u0647\u064E\u0649\u0670" }, { id: 15, text: "\u0639\u0650\u0646\u062F\u064E\u0647\u064E\u0627 \u062C\u064E\u0646\u0651\u064E\u0629\u064F \u0671\u0644\u06E1\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0653" }, { id: 16, text: "\u0625\u0650\u0630\u06E1 \u064A\u064E\u063A\u06E1\u0634\u064E\u0649 \u0671\u0644\u0633\u0651\u0650\u062F\u06E1\u0631\u064E\u0629\u064E \u0645\u064E\u0627 \u064A\u064E\u063A\u06E1\u0634\u064E\u0649\u0670" }, { id: 17, text: "\u0645\u064E\u0627 \u0632\u064E\u0627\u063A\u064E \u0671\u0644\u06E1\u0628\u064E\u0635\u064E\u0631\u064F \u0648\u064E\u0645\u064E\u0627 \u0637\u064E\u063A\u064E\u0649\u0670" }, { id: 18, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0631\u064E\u0623\u064E\u0649\u0670 \u0645\u0650\u0646\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650 \u0671\u0644\u06E1\u0643\u064F\u0628\u06E1\u0631\u064E\u0649\u0670\u0653" }, { id: 19, text: "\u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0640\u0670\u062A\u064E \u0648\u064E\u0671\u0644\u06E1\u0639\u064F\u0632\u0651\u064E\u0649\u0670" }, { id: 20, text: "\u0648\u064E\u0645\u064E\u0646\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062B\u0651\u064E\u0627\u0644\u0650\u062B\u064E\u0629\u064E \u0671\u0644\u06E1\u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670\u0653" }, { id: 21, text: "\u0623\u064E\u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0630\u0651\u064E\u0643\u064E\u0631\u064F \u0648\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u0649\u0670" }, { id: 22, text: "\u062A\u0650\u0644\u06E1\u0643\u064E \u0625\u0650\u0630\u0657\u0627 \u0642\u0650\u0633\u06E1\u0645\u064E\u0629\u065E \u0636\u0650\u064A\u0632\u064E\u0649\u0670\u0653" }, { id: 23, text: "\u0625\u0650\u0646\u06E1 \u0647\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0621\u065E \u0633\u064E\u0645\u0651\u064E\u064A\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645 \u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u064E\u0627 \u0645\u0650\u0646 \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u064D\u06DA \u0625\u0650\u0646 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0638\u0651\u064E\u0646\u0651\u064E \u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0647\u06E1\u0648\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0646\u0641\u064F\u0633\u064F\u06D6 \u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670\u0653" }, { id: 24, text: "\u0623\u064E\u0645\u06E1 \u0644\u0650\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u0650 \u0645\u064E\u0627 \u062A\u064E\u0645\u064E\u0646\u0651\u064E\u0649\u0670" }, { id: 25, text: "\u0641\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670" }, { id: 26, text: "\u06DE\u0648\u064E\u0643\u064E\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0644\u064E\u0643\u0656 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0644\u064E\u0627 \u062A\u064F\u063A\u06E1\u0646\u0650\u064A \u0634\u064E\u0641\u064E\u0670\u0639\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u0630\u064E\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670\u0653" }, { id: 27, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0644\u064E\u064A\u064F\u0633\u064E\u0645\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064E \u062A\u064E\u0633\u06E1\u0645\u0650\u064A\u064E\u0629\u064E \u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u0649\u0670" }, { id: 28, text: "\u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0644\u06E1\u0645\u064D\u06D6 \u0625\u0650\u0646 \u064A\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0638\u0651\u064E\u0646\u0651\u064E\u06D6 \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0638\u0651\u064E\u0646\u0651\u064E \u0644\u064E\u0627 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627" }, { id: 29, text: "\u0641\u064E\u0623\u064E\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646 \u0645\u0651\u064E\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650\u0646\u064E\u0627 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0631\u0650\u062F\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627" }, { id: 30, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064E\u0628\u06E1\u0644\u064E\u063A\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0646 \u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0646\u0650 \u0671\u0647\u06E1\u062A\u064E\u062F\u064E\u0649\u0670" }, { id: 31, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0644\u0650\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0633\u064E\u0640\u0670\u0653\u0640\u0654\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u062C\u06E1\u0632\u0650\u064A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649" }, { id: 32, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062C\u06E1\u062A\u064E\u0646\u0650\u0628\u064F\u0648\u0646\u064E \u0643\u064E\u0628\u064E\u0640\u0670\u0653\u0626\u0650\u0631\u064E \u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u0641\u064E\u0648\u064E\u0670\u062D\u0650\u0634\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0645\u064E\u0645\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0648\u064E\u0670\u0633\u0650\u0639\u064F \u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0650\u06DA \u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0630\u06E1 \u0623\u064E\u0646\u0634\u064E\u0623\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u062C\u0650\u0646\u0651\u064E\u0629\u065E \u0641\u0650\u064A \u0628\u064F\u0637\u064F\u0648\u0646\u0650 \u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u0650\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0632\u064E\u0643\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0646\u0650 \u0671\u062A\u0651\u064E\u0642\u064E\u0649\u0670\u0653" }, { id: 33, text: "\u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670" }, { id: 34, text: "\u0648\u064E\u0623\u064E\u0639\u06E1\u0637\u064E\u0649\u0670 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0648\u064E\u0623\u064E\u0643\u06E1\u062F\u064E\u0649\u0670\u0653" }, { id: 35, text: "\u0623\u064E\u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0639\u0650\u0644\u06E1\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0641\u064E\u0647\u064F\u0648\u064E \u064A\u064E\u0631\u064E\u0649\u0670\u0653" }, { id: 36, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0645\u06E1 \u064A\u064F\u0646\u064E\u0628\u0651\u064E\u0623\u06E1 \u0628\u0650\u0645\u064E\u0627 \u0641\u0650\u064A \u0635\u064F\u062D\u064F\u0641\u0650 \u0645\u064F\u0648\u0633\u064E\u0649\u0670" }, { id: 37, text: "\u0648\u064E\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0648\u064E\u0641\u0651\u064E\u0649\u0670\u0653" }, { id: 38, text: "\u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0632\u0650\u0631\u064F \u0648\u064E\u0627\u0632\u0650\u0631\u064E\u0629\u065E \u0648\u0650\u0632\u06E1\u0631\u064E \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670" }, { id: 39, text: "\u0648\u064E\u0623\u064E\u0646 \u0644\u0651\u064E\u064A\u06E1\u0633\u064E \u0644\u0650\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0633\u064E\u0639\u064E\u0649\u0670" }, { id: 40, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0633\u064E\u0639\u06E1\u064A\u064E\u0647\u064F\u06E5 \u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064F\u0631\u064E\u0649\u0670" }, { id: 41, text: "\u062B\u064F\u0645\u0651\u064E \u064A\u064F\u062C\u06E1\u0632\u064E\u0649\u0670\u0647\u064F \u0671\u0644\u06E1\u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u06E1\u0641\u064E\u0649\u0670" }, { id: 42, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u062A\u064E\u0647\u064E\u0649\u0670" }, { id: 43, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0623\u064E\u0636\u06E1\u062D\u064E\u0643\u064E \u0648\u064E\u0623\u064E\u0628\u06E1\u0643\u064E\u0649\u0670" }, { id: 44, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0623\u064E\u0645\u064E\u0627\u062A\u064E \u0648\u064E\u0623\u064E\u062D\u06E1\u064A\u064E\u0627" }, { id: 45, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0632\u0651\u064E\u0648\u06E1\u062C\u064E\u064A\u06E1\u0646\u0650 \u0671\u0644\u0630\u0651\u064E\u0643\u064E\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u0649\u0670" }, { id: 46, text: "\u0645\u0650\u0646 \u0646\u0651\u064F\u0637\u06E1\u0641\u064E\u0629\u064D \u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u0645\u06E1\u0646\u064E\u0649\u0670" }, { id: 47, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u0646\u0651\u064E\u0634\u06E1\u0623\u064E\u0629\u064E \u0671\u0644\u06E1\u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670" }, { id: 48, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u0642\u06E1\u0646\u064E\u0649\u0670" }, { id: 49, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u0634\u0651\u0650\u0639\u06E1\u0631\u064E\u0649\u0670" }, { id: 50, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u064E \u0639\u064E\u0627\u062F\u064B\u0627 \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670" }, { id: 51, text: "\u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064E\u0627\u0652 \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0628\u06E1\u0642\u064E\u0649\u0670" }, { id: 52, text: "\u0648\u064E\u0642\u064E\u0648\u06E1\u0645\u064E \u0646\u064F\u0648\u062D\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0647\u064F\u0645\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064E \u0648\u064E\u0623\u064E\u0637\u06E1\u063A\u064E\u0649\u0670" }, { id: 53, text: "\u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u062A\u064E\u0641\u0650\u0643\u064E\u0629\u064E \u0623\u064E\u0647\u06E1\u0648\u064E\u0649\u0670" }, { id: 54, text: "\u0641\u064E\u063A\u064E\u0634\u0651\u064E\u0649\u0670\u0647\u064E\u0627 \u0645\u064E\u0627 \u063A\u064E\u0634\u0651\u064E\u0649\u0670" }, { id: 55, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u062A\u064E\u062A\u064E\u0645\u064E\u0627\u0631\u064E\u0649\u0670" }, { id: 56, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0646\u0651\u064F\u0630\u064F\u0631\u0650 \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670\u0653" }, { id: 57, text: "\u0623\u064E\u0632\u0650\u0641\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u0653\u0632\u0650\u0641\u064E\u0629\u064F" }, { id: 58, text: "\u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064E\u0627 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0627\u0634\u0650\u0641\u064E\u0629\u064C" }, { id: 59, text: "\u0623\u064E\u0641\u064E\u0645\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u062F\u0650\u064A\u062B\u0650 \u062A\u064E\u0639\u06E1\u062C\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0648\u064E\u062A\u064E\u0636\u06E1\u062D\u064E\u0643\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0628\u06E1\u0643\u064F\u0648\u0646\u064E" }, { id: 61, text: "\u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0633\u064E\u0670\u0645\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0641\u064E\u0671\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0627\u0652\u06E4 \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06E4 \u0648\u064E\u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652\u06E9" }] }, { id: 54, name: "\u0627\u0644\u0642\u0645\u0631", transliteration: "Al-Qamar", type: "meccan", total_verses: 55, verses: [{ id: 1, text: "\u0671\u0642\u06E1\u062A\u064E\u0631\u064E\u0628\u064E\u062A\u0650 \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u0648\u064E\u0671\u0646\u0634\u064E\u0642\u0651\u064E \u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064F" }, { id: 2, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u064A\u064F\u0639\u06E1\u0631\u0650\u0636\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0645\u0650\u0631\u0651\u065E" }, { id: 3, text: "\u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0647\u06E1\u0648\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u064F \u0623\u064E\u0645\u06E1\u0631\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u0631\u0651\u065E" }, { id: 4, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0646\u06E2\u0628\u064E\u0627\u0653\u0621\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A\u0647\u0650 \u0645\u064F\u0632\u06E1\u062F\u064E\u062C\u064E\u0631\u064C" }, { id: 5, text: "\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064F\u06E2 \u0628\u064E\u0670\u0644\u0650\u063A\u064E\u0629\u065E\u06D6 \u0641\u064E\u0645\u064E\u0627 \u062A\u064F\u063A\u06E1\u0646\u0650 \u0671\u0644\u0646\u0651\u064F\u0630\u064F\u0631\u064F" }, { id: 6, text: "\u0641\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1\u06D8 \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u062F\u06E1\u0639\u064F \u0671\u0644\u062F\u0651\u064E\u0627\u0639\u0650 \u0625\u0650\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0646\u0651\u064F\u0643\u064F\u0631\u064D" }, { id: 7, text: "\u062E\u064F\u0634\u0651\u064E\u0639\u064B\u0627 \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F\u0647\u064F\u0645\u06E1 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062C\u06E1\u062F\u064E\u0627\u062B\u0650 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0631\u064E\u0627\u062F\u065E \u0645\u0651\u064F\u0646\u062A\u064E\u0634\u0650\u0631\u065E" }, { id: 8, text: "\u0645\u0651\u064F\u0647\u06E1\u0637\u0650\u0639\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u062F\u0651\u064E\u0627\u0639\u0650\u06D6 \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064C \u0639\u064E\u0633\u0650\u0631\u065E" }, { id: 9, text: "\u06DE\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064F \u0646\u064F\u0648\u062D\u0656 \u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0639\u064E\u0628\u06E1\u062F\u064E\u0646\u064E\u0627 \u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u065E \u0648\u064E\u0671\u0632\u06E1\u062F\u064F\u062C\u0650\u0631\u064E" }, { id: 10, text: "\u0641\u064E\u062F\u064E\u0639\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0646\u0651\u0650\u064A \u0645\u064E\u063A\u06E1\u0644\u064F\u0648\u0628\u065E \u0641\u064E\u0671\u0646\u062A\u064E\u0635\u0650\u0631\u06E1" }, { id: 11, text: "\u0641\u064E\u0641\u064E\u062A\u064E\u062D\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0628\u0650\u0645\u064E\u0627\u0653\u0621\u0656 \u0645\u0651\u064F\u0646\u06E1\u0647\u064E\u0645\u0650\u0631\u0656" }, { id: 12, text: "\u0648\u064E\u0641\u064E\u062C\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0639\u064F\u064A\u064F\u0648\u0646\u0657\u0627 \u0641\u064E\u0671\u0644\u06E1\u062A\u064E\u0642\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064F \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u06E1\u0631\u0656 \u0642\u064E\u062F\u06E1 \u0642\u064F\u062F\u0650\u0631\u064E" }, { id: 13, text: "\u0648\u064E\u062D\u064E\u0645\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0630\u064E\u0627\u062A\u0650 \u0623\u064E\u0644\u06E1\u0648\u064E\u0670\u062D\u0656 \u0648\u064E\u062F\u064F\u0633\u064F\u0631\u0656" }, { id: 14, text: "\u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0628\u0650\u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u0650\u0646\u064E\u0627 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u0657 \u0644\u0651\u0650\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0643\u064F\u0641\u0650\u0631\u064E" }, { id: 15, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F \u062A\u0651\u064E\u0631\u064E\u0643\u06E1\u0646\u064E\u0670\u0647\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0629\u0657 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0645\u0651\u064F\u062F\u0651\u064E\u0643\u0650\u0631\u0656" }, { id: 16, text: "\u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u0650\u064A \u0648\u064E\u0646\u064F\u0630\u064F\u0631\u0650" }, { id: 17, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u064A\u064E\u0633\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0645\u0651\u064F\u062F\u0651\u064E\u0643\u0650\u0631\u0656" }, { id: 18, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u0639\u064E\u0627\u062F\u065E \u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u0650\u064A \u0648\u064E\u0646\u064F\u0630\u064F\u0631\u0650" }, { id: 19, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0631\u0650\u064A\u062D\u0657\u0627 \u0635\u064E\u0631\u06E1\u0635\u064E\u0631\u0657\u0627 \u0641\u0650\u064A \u064A\u064E\u0648\u06E1\u0645\u0650 \u0646\u064E\u062D\u06E1\u0633\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0645\u0650\u0631\u0651\u0656" }, { id: 20, text: "\u062A\u064E\u0646\u0632\u0650\u0639\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u062C\u064E\u0627\u0632\u064F \u0646\u064E\u062E\u06E1\u0644\u0656 \u0645\u0651\u064F\u0646\u0642\u064E\u0639\u0650\u0631\u0656" }, { id: 21, text: "\u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u0650\u064A \u0648\u064E\u0646\u064F\u0630\u064F\u0631\u0650" }, { id: 22, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u064A\u064E\u0633\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0645\u0651\u064F\u062F\u0651\u064E\u0643\u0650\u0631\u0656" }, { id: 23, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u062B\u064E\u0645\u064F\u0648\u062F\u064F \u0628\u0650\u0671\u0644\u0646\u0651\u064F\u0630\u064F\u0631\u0650" }, { id: 24, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0628\u064E\u0634\u064E\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u0651\u064E\u0627 \u0648\u064E\u0670\u062D\u0650\u062F\u0657\u0627 \u0646\u0651\u064E\u062A\u0651\u064E\u0628\u0650\u0639\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0630\u0657\u0627 \u0644\u0651\u064E\u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0648\u064E\u0633\u064F\u0639\u064F\u0631\u064D" }, { id: 25, text: "\u0623\u064E\u0621\u064F\u0644\u06E1\u0642\u0650\u064A\u064E \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650\u0646\u064E\u0627 \u0628\u064E\u0644\u06E1 \u0647\u064F\u0648\u064E \u0643\u064E\u0630\u0651\u064E\u0627\u0628\u064C \u0623\u064E\u0634\u0650\u0631\u065E" }, { id: 26, text: "\u0633\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u063A\u064E\u062F\u0657\u0627 \u0645\u0651\u064E\u0646\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0651\u064E\u0627\u0628\u064F \u0671\u0644\u06E1\u0623\u064E\u0634\u0650\u0631\u064F" }, { id: 27, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0645\u064F\u0631\u06E1\u0633\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0646\u0651\u064E\u0627\u0642\u064E\u0629\u0650 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0657 \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0671\u0631\u06E1\u062A\u064E\u0642\u0650\u0628\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0635\u06E1\u0637\u064E\u0628\u0650\u0631\u06E1" }, { id: 28, text: "\u0648\u064E\u0646\u064E\u0628\u0651\u0650\u0626\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064E \u0642\u0650\u0633\u06E1\u0645\u064E\u0629\u064F\u06E2 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0643\u064F\u0644\u0651\u064F \u0634\u0650\u0631\u06E1\u0628\u0656 \u0645\u0651\u064F\u062D\u06E1\u062A\u064E\u0636\u064E\u0631\u065E" }, { id: 29, text: "\u0641\u064E\u0646\u064E\u0627\u062F\u064E\u0648\u06E1\u0627\u0652 \u0635\u064E\u0627\u062D\u0650\u0628\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u062A\u064E\u0639\u064E\u0627\u0637\u064E\u0649\u0670 \u0641\u064E\u0639\u064E\u0642\u064E\u0631\u064E" }, { id: 30, text: "\u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u0650\u064A \u0648\u064E\u0646\u064F\u0630\u064F\u0631\u0650" }, { id: 31, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0635\u064E\u064A\u06E1\u062D\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657 \u0641\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0647\u064E\u0634\u0650\u064A\u0645\u0650 \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u062A\u064E\u0638\u0650\u0631\u0650" }, { id: 32, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u064A\u064E\u0633\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0645\u0651\u064F\u062F\u0651\u064E\u0643\u0650\u0631\u0656" }, { id: 33, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064F \u0644\u064F\u0648\u0637\u0650\u06ED \u0628\u0650\u0671\u0644\u0646\u0651\u064F\u0630\u064F\u0631\u0650" }, { id: 34, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062D\u064E\u0627\u0635\u0650\u0628\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u0644\u064E \u0644\u064F\u0648\u0637\u0656\u06D6 \u0646\u0651\u064E\u062C\u0651\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0628\u0650\u0633\u064E\u062D\u064E\u0631\u0656" }, { id: 35, text: "\u0646\u0651\u0650\u0639\u06E1\u0645\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u06E1 \u0639\u0650\u0646\u062F\u0650\u0646\u064E\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0645\u064E\u0646 \u0634\u064E\u0643\u064E\u0631\u064E" }, { id: 36, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0646\u0630\u064E\u0631\u064E\u0647\u064F\u0645 \u0628\u064E\u0637\u06E1\u0634\u064E\u062A\u064E\u0646\u064E\u0627 \u0641\u064E\u062A\u064E\u0645\u064E\u0627\u0631\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0671\u0644\u0646\u0651\u064F\u0630\u064F\u0631\u0650" }, { id: 37, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0631\u064E\u0670\u0648\u064E\u062F\u064F\u0648\u0647\u064F \u0639\u064E\u0646 \u0636\u064E\u064A\u06E1\u0641\u0650\u0647\u0650\u06E6 \u0641\u064E\u0637\u064E\u0645\u064E\u0633\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u064A\u064F\u0646\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u0650\u064A \u0648\u064E\u0646\u064F\u0630\u064F\u0631\u0650" }, { id: 38, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0635\u064E\u0628\u0651\u064E\u062D\u064E\u0647\u064F\u0645 \u0628\u064F\u0643\u06E1\u0631\u064E\u0629\u064B \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u0631\u0651\u065E" }, { id: 39, text: "\u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0630\u064E\u0627\u0628\u0650\u064A \u0648\u064E\u0646\u064F\u0630\u064F\u0631\u0650" }, { id: 40, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u064A\u064E\u0633\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0644\u0650\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u0650 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0645\u0651\u064F\u062F\u0651\u064E\u0643\u0650\u0631\u0656" }, { id: 41, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E \u0621\u064E\u0627\u0644\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0671\u0644\u0646\u0651\u064F\u0630\u064F\u0631\u064F" }, { id: 42, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0643\u064F\u0644\u0651\u0650\u0647\u064E\u0627 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0623\u064E\u062E\u06E1\u0630\u064E \u0639\u064E\u0632\u0650\u064A\u0632\u0656 \u0645\u0651\u064F\u0642\u06E1\u062A\u064E\u062F\u0650\u0631\u064D" }, { id: 43, text: "\u0623\u064E\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064F\u0643\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1 \u0644\u064E\u0643\u064F\u0645 \u0628\u064E\u0631\u064E\u0627\u0653\u0621\u064E\u0629\u065E \u0641\u0650\u064A \u0671\u0644\u0632\u0651\u064F\u0628\u064F\u0631\u0650" }, { id: 44, text: "\u0623\u064E\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0646\u064E\u062D\u06E1\u0646\u064F \u062C\u064E\u0645\u0650\u064A\u0639\u065E \u0645\u0651\u064F\u0646\u062A\u064E\u0635\u0650\u0631\u065E" }, { id: 45, text: "\u0633\u064E\u064A\u064F\u0647\u06E1\u0632\u064E\u0645\u064F \u0671\u0644\u06E1\u062C\u064E\u0645\u06E1\u0639\u064F \u0648\u064E\u064A\u064F\u0648\u064E\u0644\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u062F\u0651\u064F\u0628\u064F\u0631\u064E" }, { id: 46, text: "\u0628\u064E\u0644\u0650 \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u0645\u064E\u0648\u06E1\u0639\u0650\u062F\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u064F \u0623\u064E\u062F\u06E1\u0647\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u0645\u064E\u0631\u0651\u064F" }, { id: 47, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0648\u064E\u0633\u064F\u0639\u064F\u0631\u0656" }, { id: 48, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0633\u06E1\u062D\u064E\u0628\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064F\u062C\u064F\u0648\u0647\u0650\u0647\u0650\u0645\u06E1 \u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0645\u064E\u0633\u0651\u064E \u0633\u064E\u0642\u064E\u0631\u064E" }, { id: 49, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F \u0628\u0650\u0642\u064E\u062F\u064E\u0631\u0656" }, { id: 50, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0631\u064F\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u065E \u0643\u064E\u0644\u064E\u0645\u06E1\u062D\u0650\u06ED \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u0635\u064E\u0631\u0650" }, { id: 51, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0634\u06E1\u064A\u064E\u0627\u0639\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0647\u064E\u0644\u06E1 \u0645\u0650\u0646 \u0645\u0651\u064F\u062F\u0651\u064E\u0643\u0650\u0631\u0656" }, { id: 52, text: "\u0648\u064E\u0643\u064F\u0644\u0651\u064F \u0634\u064E\u064A\u06E1\u0621\u0656 \u0641\u064E\u0639\u064E\u0644\u064F\u0648\u0647\u064F \u0641\u0650\u064A \u0671\u0644\u0632\u0651\u064F\u0628\u064F\u0631\u0650" }, { id: 53, text: "\u0648\u064E\u0643\u064F\u0644\u0651\u064F \u0635\u064E\u063A\u0650\u064A\u0631\u0656 \u0648\u064E\u0643\u064E\u0628\u0650\u064A\u0631\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0637\u064E\u0631\u064C" }, { id: 54, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u0646\u064E\u0647\u064E\u0631\u0656" }, { id: 55, text: "\u0641\u0650\u064A \u0645\u064E\u0642\u06E1\u0639\u064E\u062F\u0650 \u0635\u0650\u062F\u06E1\u0642\u064D \u0639\u0650\u0646\u062F\u064E \u0645\u064E\u0644\u0650\u064A\u0643\u0656 \u0645\u0651\u064F\u0642\u06E1\u062A\u064E\u062F\u0650\u0631\u0650\u06ED" }] }, { id: 55, name: "\u0627\u0644\u0631\u062D\u0645\u0646", transliteration: "Ar-Rahman", type: "medinan", total_verses: 78, verses: [{ id: 1, text: "\u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F" }, { id: 2, text: "\u0639\u064E\u0644\u0651\u064E\u0645\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E" }, { id: 3, text: "\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E" }, { id: 4, text: "\u0639\u064E\u0644\u0651\u064E\u0645\u064E\u0647\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u064E\u0627\u0646\u064E" }, { id: 5, text: "\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064F \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064F \u0628\u0650\u062D\u064F\u0633\u06E1\u0628\u064E\u0627\u0646\u0656" }, { id: 6, text: "\u0648\u064E\u0671\u0644\u0646\u0651\u064E\u062C\u06E1\u0645\u064F \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u062C\u064E\u0631\u064F \u064A\u064E\u0633\u06E1\u062C\u064F\u062F\u064E\u0627\u0646\u0650" }, { id: 7, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0641\u064E\u0639\u064E\u0647\u064E\u0627 \u0648\u064E\u0648\u064E\u0636\u064E\u0639\u064E \u0671\u0644\u06E1\u0645\u0650\u064A\u0632\u064E\u0627\u0646\u064E" }, { id: 8, text: "\u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064E\u0637\u06E1\u063A\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u0650\u064A\u0632\u064E\u0627\u0646\u0650" }, { id: 9, text: "\u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0648\u064E\u0632\u06E1\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u062E\u06E1\u0633\u0650\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u0650\u064A\u0632\u064E\u0627\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0648\u064E\u0636\u064E\u0639\u064E\u0647\u064E\u0627 \u0644\u0650\u0644\u06E1\u0623\u064E\u0646\u064E\u0627\u0645\u0650" }, { id: 11, text: "\u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u065E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u062E\u06E1\u0644\u064F \u0630\u064E\u0627\u062A\u064F \u0671\u0644\u06E1\u0623\u064E\u0643\u06E1\u0645\u064E\u0627\u0645\u0650" }, { id: 12, text: "\u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u0628\u0651\u064F \u0630\u064F\u0648 \u0671\u0644\u06E1\u0639\u064E\u0635\u06E1\u0641\u0650 \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u064A\u06E1\u062D\u064E\u0627\u0646\u064F" }, { id: 13, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 14, text: "\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0645\u0650\u0646 \u0635\u064E\u0644\u06E1\u0635\u064E\u0670\u0644\u0656 \u0643\u064E\u0671\u0644\u06E1\u0641\u064E\u062E\u0651\u064E\u0627\u0631\u0650" }, { id: 15, text: "\u0648\u064E\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u062C\u064E\u0627\u0653\u0646\u0651\u064E \u0645\u0650\u0646 \u0645\u0651\u064E\u0627\u0631\u0650\u062C\u0656 \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0627\u0631\u0656" }, { id: 16, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 17, text: "\u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0631\u0650\u0642\u064E\u064A\u06E1\u0646\u0650 \u0648\u064E\u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0631\u0650\u0628\u064E\u064A\u06E1\u0646\u0650" }, { id: 18, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 19, text: "\u0645\u064E\u0631\u064E\u062C\u064E \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u064E\u064A\u06E1\u0646\u0650 \u064A\u064E\u0644\u06E1\u062A\u064E\u0642\u0650\u064A\u064E\u0627\u0646\u0650" }, { id: 20, text: "\u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0628\u064E\u0631\u06E1\u0632\u064E\u062E\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0628\u06E1\u063A\u0650\u064A\u064E\u0627\u0646\u0650" }, { id: 21, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 22, text: "\u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u0644\u0651\u064F\u0624\u06E1\u0644\u064F\u0624\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u062C\u064E\u0627\u0646\u064F" }, { id: 23, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 24, text: "\u0648\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u062C\u064E\u0648\u064E\u0627\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u0646\u0634\u064E\u0640\u0654\u064E\u0627\u062A\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u064E\u062D\u06E1\u0631\u0650 \u0643\u064E\u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0670\u0645\u0650" }, { id: 25, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 26, text: "\u0643\u064F\u0644\u0651\u064F \u0645\u064E\u0646\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0641\u064E\u0627\u0646\u0656" }, { id: 27, text: "\u0648\u064E\u064A\u064E\u0628\u06E1\u0642\u064E\u0649\u0670 \u0648\u064E\u062C\u06E1\u0647\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0630\u064F\u0648 \u0671\u0644\u06E1\u062C\u064E\u0644\u064E\u0670\u0644\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0643\u06E1\u0631\u064E\u0627\u0645\u0650" }, { id: 28, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 29, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0647\u064F\u06E5 \u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0643\u064F\u0644\u0651\u064E \u064A\u064E\u0648\u06E1\u0645\u064D \u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0634\u064E\u0623\u06E1\u0646\u0656" }, { id: 30, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 31, text: "\u0633\u064E\u0646\u064E\u0641\u06E1\u0631\u064F\u063A\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u0651\u064F\u0647\u064E \u0671\u0644\u062B\u0651\u064E\u0642\u064E\u0644\u064E\u0627\u0646\u0650" }, { id: 32, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 33, text: "\u064A\u064E\u0670\u0645\u064E\u0639\u06E1\u0634\u064E\u0631\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650 \u0625\u0650\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0639\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0646\u0641\u064F\u0630\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0642\u06E1\u0637\u064E\u0627\u0631\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0641\u064E\u0671\u0646\u0641\u064F\u0630\u064F\u0648\u0627\u0652\u06DA \u0644\u064E\u0627 \u062A\u064E\u0646\u0641\u064F\u0630\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0656" }, { id: 34, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 35, text: "\u064A\u064F\u0631\u06E1\u0633\u064E\u0644\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u064E\u0627 \u0634\u064F\u0648\u064E\u0627\u0638\u065E \u0645\u0651\u0650\u0646 \u0646\u0651\u064E\u0627\u0631\u0656 \u0648\u064E\u0646\u064F\u062D\u064E\u0627\u0633\u065E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u062A\u064E\u0635\u0650\u0631\u064E\u0627\u0646\u0650" }, { id: 36, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 37, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0646\u0634\u064E\u0642\u0651\u064E\u062A\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0641\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0648\u064E\u0631\u06E1\u062F\u064E\u0629\u0657 \u0643\u064E\u0671\u0644\u062F\u0651\u0650\u0647\u064E\u0627\u0646\u0650" }, { id: 38, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 39, text: "\u0641\u064E\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F \u0639\u064E\u0646 \u0630\u064E\u0646\u06E2\u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0646\u0633\u065E \u0648\u064E\u0644\u064E\u0627 \u062C\u064E\u0627\u0653\u0646\u0651\u065E" }, { id: 40, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 41, text: "\u064A\u064F\u0639\u06E1\u0631\u064E\u0641\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E \u0628\u0650\u0633\u0650\u064A\u0645\u064E\u0670\u0647\u064F\u0645\u06E1 \u0641\u064E\u064A\u064F\u0624\u06E1\u062E\u064E\u0630\u064F \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0648\u064E\u0670\u0635\u0650\u064A \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0642\u06E1\u062F\u064E\u0627\u0645\u0650" }, { id: 42, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 43, text: "\u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F \u0628\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u064A\u064E\u0637\u064F\u0648\u0641\u064F\u0648\u0646\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E \u062D\u064E\u0645\u0650\u064A\u0645\u064D \u0621\u064E\u0627\u0646\u0656" }, { id: 45, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 46, text: "\u0648\u064E\u0644\u0650\u0645\u064E\u0646\u06E1 \u062E\u064E\u0627\u0641\u064E \u0645\u064E\u0642\u064E\u0627\u0645\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u062C\u064E\u0646\u0651\u064E\u062A\u064E\u0627\u0646\u0650" }, { id: 47, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 48, text: "\u0630\u064E\u0648\u064E\u0627\u062A\u064E\u0627\u0653 \u0623\u064E\u0641\u06E1\u0646\u064E\u0627\u0646\u0656" }, { id: 49, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 50, text: "\u0641\u0650\u064A\u0647\u0650\u0645\u064E\u0627 \u0639\u064E\u064A\u06E1\u0646\u064E\u0627\u0646\u0650 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A\u064E\u0627\u0646\u0650" }, { id: 51, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 52, text: "\u0641\u0650\u064A\u0647\u0650\u0645\u064E\u0627 \u0645\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u0656 \u0632\u064E\u0648\u06E1\u062C\u064E\u0627\u0646\u0650" }, { id: 53, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 54, text: "\u0645\u064F\u062A\u0651\u064E\u0643\u0650\u0640\u0654\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0641\u064F\u0631\u064F\u0634\u0650\u06ED \u0628\u064E\u0637\u064E\u0627\u0653\u0626\u0650\u0646\u064F\u0647\u064E\u0627 \u0645\u0650\u0646\u06E1 \u0625\u0650\u0633\u06E1\u062A\u064E\u0628\u06E1\u0631\u064E\u0642\u0656\u06DA \u0648\u064E\u062C\u064E\u0646\u064E\u0649 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u062F\u064E\u0627\u0646\u0656" }, { id: 55, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 56, text: "\u0641\u0650\u064A\u0647\u0650\u0646\u0651\u064E \u0642\u064E\u0670\u0635\u0650\u0631\u064E\u0670\u062A\u064F \u0671\u0644\u0637\u0651\u064E\u0631\u06E1\u0641\u0650 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0637\u06E1\u0645\u0650\u062B\u06E1\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0646\u0633\u065E \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062C\u064E\u0627\u0653\u0646\u0651\u065E" }, { id: 57, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 58, text: "\u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0646\u0651\u064E \u0671\u0644\u06E1\u064A\u064E\u0627\u0642\u064F\u0648\u062A\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u062C\u064E\u0627\u0646\u064F" }, { id: 59, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 60, text: "\u0647\u064E\u0644\u06E1 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u06E1\u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u062D\u06E1\u0633\u064E\u0670\u0646\u064F" }, { id: 61, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 62, text: "\u0648\u064E\u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u0645\u064E\u0627 \u062C\u064E\u0646\u0651\u064E\u062A\u064E\u0627\u0646\u0650" }, { id: 63, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 64, text: "\u0645\u064F\u062F\u06E1\u0647\u064E\u0627\u0653\u0645\u0651\u064E\u062A\u064E\u0627\u0646\u0650" }, { id: 65, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 66, text: "\u0641\u0650\u064A\u0647\u0650\u0645\u064E\u0627 \u0639\u064E\u064A\u06E1\u0646\u064E\u0627\u0646\u0650 \u0646\u064E\u0636\u0651\u064E\u0627\u062E\u064E\u062A\u064E\u0627\u0646\u0650" }, { id: 67, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 68, text: "\u0641\u0650\u064A\u0647\u0650\u0645\u064E\u0627 \u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u065E \u0648\u064E\u0646\u064E\u062E\u06E1\u0644\u065E \u0648\u064E\u0631\u064F\u0645\u0651\u064E\u0627\u0646\u065E" }, { id: 69, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 70, text: "\u0641\u0650\u064A\u0647\u0650\u0646\u0651\u064E \u062E\u064E\u064A\u06E1\u0631\u064E\u0670\u062A\u064C \u062D\u0650\u0633\u064E\u0627\u0646\u065E" }, { id: 71, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 72, text: "\u062D\u064F\u0648\u0631\u065E \u0645\u0651\u064E\u0642\u06E1\u0635\u064F\u0648\u0631\u064E\u0670\u062A\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u062E\u0650\u064A\u064E\u0627\u0645\u0650" }, { id: 73, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 74, text: "\u0644\u064E\u0645\u06E1 \u064A\u064E\u0637\u06E1\u0645\u0650\u062B\u06E1\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0646\u0633\u065E \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062C\u064E\u0627\u0653\u0646\u0651\u065E" }, { id: 75, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 76, text: "\u0645\u064F\u062A\u0651\u064E\u0643\u0650\u0640\u0654\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0641\u06E1\u0631\u064E\u0641\u064D \u062E\u064F\u0636\u06E1\u0631\u0656 \u0648\u064E\u0639\u064E\u0628\u06E1\u0642\u064E\u0631\u0650\u064A\u0651\u064D \u062D\u0650\u0633\u064E\u0627\u0646\u0656" }, { id: 77, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0621\u064E\u0627\u0644\u064E\u0627\u0653\u0621\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u064E\u0627 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064E\u0627\u0646\u0650" }, { id: 78, text: "\u062A\u064E\u0628\u064E\u0670\u0631\u064E\u0643\u064E \u0671\u0633\u06E1\u0645\u064F \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0630\u0650\u064A \u0671\u0644\u06E1\u062C\u064E\u0644\u064E\u0670\u0644\u0650 \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u0643\u06E1\u0631\u064E\u0627\u0645\u0650" }] }, { id: 56, name: "\u0627\u0644\u0648\u0627\u0642\u0639\u0629", transliteration: "Al-Waqi'ah", type: "meccan", total_verses: 96, verses: [{ id: 1, text: "\u0625\u0650\u0630\u064E\u0627 \u0648\u064E\u0642\u064E\u0639\u064E\u062A\u0650 \u0671\u0644\u06E1\u0648\u064E\u0627\u0642\u0650\u0639\u064E\u0629\u064F" }, { id: 2, text: "\u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u0650\u0648\u064E\u0642\u06E1\u0639\u064E\u062A\u0650\u0647\u064E\u0627 \u0643\u064E\u0627\u0630\u0650\u0628\u064E\u0629\u064C" }, { id: 3, text: "\u062E\u064E\u0627\u0641\u0650\u0636\u064E\u0629\u065E \u0631\u0651\u064E\u0627\u0641\u0650\u0639\u064E\u0629\u064C" }, { id: 4, text: "\u0625\u0650\u0630\u064E\u0627 \u0631\u064F\u062C\u0651\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0631\u064E\u062C\u0651\u0657\u0627" }, { id: 5, text: "\u0648\u064E\u0628\u064F\u0633\u0651\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0628\u064E\u0633\u0651\u0657\u0627" }, { id: 6, text: "\u0641\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0647\u064E\u0628\u064E\u0627\u0653\u0621\u0657 \u0645\u0651\u064F\u0646\u06E2\u0628\u064E\u062B\u0651\u0657\u0627" }, { id: 7, text: "\u0648\u064E\u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627 \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u0657" }, { id: 8, text: "\u0641\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u0645\u064E\u0646\u064E\u0629\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u0645\u064E\u0646\u064E\u0629\u0650" }, { id: 9, text: "\u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0640\u0654\u064E\u0645\u064E\u0629\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0640\u0654\u064E\u0645\u064E\u0629\u0650" }, { id: 10, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0640\u0670\u0628\u0650\u0642\u064F\u0648\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0640\u0670\u0628\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0631\u0651\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u0639\u0650\u064A\u0645\u0650" }, { id: 13, text: "\u062B\u064F\u0644\u0651\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0648\u064E\u0642\u064E\u0644\u0650\u064A\u0644\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 15, text: "\u0639\u064E\u0644\u064E\u0649\u0670 \u0633\u064F\u0631\u064F\u0631\u0656 \u0645\u0651\u064E\u0648\u06E1\u0636\u064F\u0648\u0646\u064E\u0629\u0656" }, { id: 16, text: "\u0645\u0651\u064F\u062A\u0651\u064E\u0643\u0650\u0640\u0654\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0645\u064F\u062A\u064E\u0642\u064E\u0670\u0628\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u064A\u064E\u0637\u064F\u0648\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u0650\u0644\u06E1\u062F\u064E\u0670\u0646\u065E \u0645\u0651\u064F\u062E\u064E\u0644\u0651\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0628\u0650\u0623\u064E\u0643\u06E1\u0648\u064E\u0627\u0628\u0656 \u0648\u064E\u0623\u064E\u0628\u064E\u0627\u0631\u0650\u064A\u0642\u064E \u0648\u064E\u0643\u064E\u0623\u06E1\u0633\u0656 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0639\u0650\u064A\u0646\u0656" }, { id: 19, text: "\u0644\u0651\u064E\u0627 \u064A\u064F\u0635\u064E\u062F\u0651\u064E\u0639\u064F\u0648\u0646\u064E \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0646\u0632\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0648\u064E\u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u062A\u064E\u062E\u064E\u064A\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0644\u064E\u062D\u06E1\u0645\u0650 \u0637\u064E\u064A\u06E1\u0631\u0656 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0634\u06E1\u062A\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0648\u064E\u062D\u064F\u0648\u0631\u064C \u0639\u0650\u064A\u0646\u065E" }, { id: 23, text: "\u0643\u064E\u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u0650 \u0671\u0644\u0644\u0651\u064F\u0624\u06E1\u0644\u064F\u0648\u0655\u0650 \u0671\u0644\u06E1\u0645\u064E\u0643\u06E1\u0646\u064F\u0648\u0646\u0650" }, { id: 24, text: "\u062C\u064E\u0632\u064E\u0627\u0653\u0621\u064E\u06E2 \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064E\u063A\u06E1\u0648\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u062B\u0650\u064A\u0645\u064B\u0627" }, { id: 26, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u0650\u064A\u0644\u0657\u0627 \u0633\u064E\u0644\u064E\u0670\u0645\u0657\u0627 \u0633\u064E\u0644\u064E\u0670\u0645\u0657\u0627" }, { id: 27, text: "\u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650" }, { id: 28, text: "\u0641\u0650\u064A \u0633\u0650\u062F\u06E1\u0631\u0656 \u0645\u0651\u064E\u062E\u06E1\u0636\u064F\u0648\u062F\u0656" }, { id: 29, text: "\u0648\u064E\u0637\u064E\u0644\u06E1\u062D\u0656 \u0645\u0651\u064E\u0646\u0636\u064F\u0648\u062F\u0656" }, { id: 30, text: "\u0648\u064E\u0638\u0650\u0644\u0651\u0656 \u0645\u0651\u064E\u0645\u06E1\u062F\u064F\u0648\u062F\u0656" }, { id: 31, text: "\u0648\u064E\u0645\u064E\u0627\u0653\u0621\u0656 \u0645\u0651\u064E\u0633\u06E1\u0643\u064F\u0648\u0628\u0656" }, { id: 32, text: "\u0648\u064E\u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u0656 \u0643\u064E\u062B\u0650\u064A\u0631\u064E\u0629\u0656" }, { id: 33, text: "\u0644\u0651\u064E\u0627 \u0645\u064E\u0642\u06E1\u0637\u064F\u0648\u0639\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u0627 \u0645\u064E\u0645\u06E1\u0646\u064F\u0648\u0639\u064E\u0629\u0656" }, { id: 34, text: "\u0648\u064E\u0641\u064F\u0631\u064F\u0634\u0656 \u0645\u0651\u064E\u0631\u06E1\u0641\u064F\u0648\u0639\u064E\u0629\u064D" }, { id: 35, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0634\u064E\u0623\u06E1\u0646\u064E\u0670\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0646\u0634\u064E\u0627\u0653\u0621\u0657" }, { id: 36, text: "\u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F\u0646\u0651\u064E \u0623\u064E\u0628\u06E1\u0643\u064E\u0627\u0631\u064B\u0627" }, { id: 37, text: "\u0639\u064F\u0631\u064F\u0628\u064B\u0627 \u0623\u064E\u062A\u06E1\u0631\u064E\u0627\u0628\u0657\u0627" }, { id: 38, text: "\u0644\u0651\u0650\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650" }, { id: 39, text: "\u062B\u064F\u0644\u0651\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 40, text: "\u0648\u064E\u062B\u064F\u0644\u0651\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0634\u0651\u0650\u0645\u064E\u0627\u0644\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0634\u0651\u0650\u0645\u064E\u0627\u0644\u0650" }, { id: 42, text: "\u0641\u0650\u064A \u0633\u064E\u0645\u064F\u0648\u0645\u0656 \u0648\u064E\u062D\u064E\u0645\u0650\u064A\u0645\u0656" }, { id: 43, text: "\u0648\u064E\u0638\u0650\u0644\u0651\u0656 \u0645\u0651\u0650\u0646 \u064A\u064E\u062D\u06E1\u0645\u064F\u0648\u0645\u0656" }, { id: 44, text: "\u0644\u0651\u064E\u0627 \u0628\u064E\u0627\u0631\u0650\u062F\u0656 \u0648\u064E\u0644\u064E\u0627 \u0643\u064E\u0631\u0650\u064A\u0645\u064D" }, { id: 45, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0642\u064E\u0628\u06E1\u0644\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0645\u064F\u062A\u06E1\u0631\u064E\u0641\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0635\u0650\u0631\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u062D\u0650\u0646\u062B\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 47, text: "\u0648\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u0626\u0650\u0630\u064E\u0627 \u0645\u0650\u062A\u06E1\u0646\u064E\u0627 \u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u062A\u064F\u0631\u064E\u0627\u0628\u0657\u0627 \u0648\u064E\u0639\u0650\u0638\u064E\u0670\u0645\u064B\u0627 \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064E\u0628\u06E1\u0639\u064F\u0648\u062B\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0623\u064E\u0648\u064E\u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0624\u064F\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0644\u064E\u0645\u064E\u062C\u06E1\u0645\u064F\u0648\u0639\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u0650\u064A\u0642\u064E\u0670\u062A\u0650 \u064A\u064E\u0648\u06E1\u0645\u0656 \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u0656" }, { id: 51, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0636\u0651\u064E\u0627\u0653\u0644\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 52, text: "\u0644\u064E\u0623\u0653\u0643\u0650\u0644\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0634\u064E\u062C\u064E\u0631\u0656 \u0645\u0651\u0650\u0646 \u0632\u064E\u0642\u0651\u064F\u0648\u0645\u0656" }, { id: 53, text: "\u0641\u064E\u0645\u064E\u0627\u0644\u0650\u0640\u0654\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0671\u0644\u06E1\u0628\u064F\u0637\u064F\u0648\u0646\u064E" }, { id: 54, text: "\u0641\u064E\u0634\u064E\u0670\u0631\u0650\u0628\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u0645\u0650" }, { id: 55, text: "\u0641\u064E\u0634\u064E\u0670\u0631\u0650\u0628\u064F\u0648\u0646\u064E \u0634\u064F\u0631\u06E1\u0628\u064E \u0671\u0644\u06E1\u0647\u0650\u064A\u0645\u0650" }, { id: 56, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u0646\u064F\u0632\u064F\u0644\u064F\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 57, text: "\u0646\u064E\u062D\u06E1\u0646\u064F \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u062A\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 58, text: "\u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u062A\u064F\u0645\u06E1\u0646\u064F\u0648\u0646\u064E" }, { id: 59, text: "\u0621\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u062E\u06E1\u0644\u064F\u0642\u064F\u0648\u0646\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0645\u06E1 \u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0644\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 60, text: "\u0646\u064E\u062D\u06E1\u0646\u064F \u0642\u064E\u062F\u0651\u064E\u0631\u06E1\u0646\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u0645\u064E\u0633\u06E1\u0628\u064F\u0648\u0642\u0650\u064A\u0646\u064E" }, { id: 61, text: "\u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u0646\u0651\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064E \u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0646\u064F\u0646\u0634\u0650\u0626\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 62, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0634\u06E1\u0623\u064E\u0629\u064E \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670 \u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 63, text: "\u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u064E\u0627 \u062A\u064E\u062D\u06E1\u0631\u064F\u062B\u064F\u0648\u0646\u064E" }, { id: 64, text: "\u0621\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0632\u06E1\u0631\u064E\u0639\u064F\u0648\u0646\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0645\u06E1 \u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u0632\u0651\u064E\u0640\u0670\u0631\u0650\u0639\u064F\u0648\u0646\u064E" }, { id: 65, text: "\u0644\u064E\u0648\u06E1 \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0644\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u062D\u064F\u0637\u064E\u0670\u0645\u0657\u0627 \u0641\u064E\u0638\u064E\u0644\u06E1\u062A\u064F\u0645\u06E1 \u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 66, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064F\u063A\u06E1\u0631\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 67, text: "\u0628\u064E\u0644\u06E1 \u0646\u064E\u062D\u06E1\u0646\u064F \u0645\u064E\u062D\u06E1\u0631\u064F\u0648\u0645\u064F\u0648\u0646\u064E" }, { id: 68, text: "\u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062A\u064E\u0634\u06E1\u0631\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 69, text: "\u0621\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0632\u06E1\u0646\u0650 \u0623\u064E\u0645\u06E1 \u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u0632\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 70, text: "\u0644\u064E\u0648\u06E1 \u0646\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0623\u064F\u062C\u064E\u0627\u062C\u0657\u0627 \u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 71, text: "\u0623\u064E\u0641\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062A\u064F\u0648\u0631\u064F\u0648\u0646\u064E" }, { id: 72, text: "\u0621\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u0634\u064E\u0623\u06E1\u062A\u064F\u0645\u06E1 \u0634\u064E\u062C\u064E\u0631\u064E\u062A\u064E\u0647\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1 \u0646\u064E\u062D\u06E1\u0646\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u0634\u0650\u0640\u0654\u064F\u0648\u0646\u064E" }, { id: 73, text: "\u0646\u064E\u062D\u06E1\u0646\u064F \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u062A\u064E\u0630\u06E1\u0643\u0650\u0631\u064E\u0629\u0657 \u0648\u064E\u0645\u064E\u062A\u064E\u0670\u0639\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0642\u06E1\u0648\u0650\u064A\u0646\u064E" }, { id: 74, text: "\u0641\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u0671\u0633\u06E1\u0645\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 75, text: "\u06DE\u0641\u064E\u0644\u064E\u0627\u0653 \u0623\u064F\u0642\u06E1\u0633\u0650\u0645\u064F \u0628\u0650\u0645\u064E\u0648\u064E\u0670\u0642\u0650\u0639\u0650 \u0671\u0644\u0646\u0651\u064F\u062C\u064F\u0648\u0645\u0650" }, { id: 76, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0642\u064E\u0633\u064E\u0645\u065E \u0644\u0651\u064E\u0648\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0639\u064E\u0638\u0650\u064A\u0645\u064C" }, { id: 77, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u065E" }, { id: 78, text: "\u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u064E\u0643\u06E1\u0646\u064F\u0648\u0646\u0656" }, { id: 79, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0645\u064E\u0633\u0651\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0637\u064E\u0647\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 80, text: "\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 81, text: "\u0623\u064E\u0641\u064E\u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u062F\u0650\u064A\u062B\u0650 \u0623\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u062F\u06E1\u0647\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 82, text: "\u0648\u064E\u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E \u0631\u0650\u0632\u06E1\u0642\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 83, text: "\u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E\u062A\u0650 \u0671\u0644\u06E1\u062D\u064F\u0644\u06E1\u0642\u064F\u0648\u0645\u064E" }, { id: 84, text: "\u0648\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u062D\u0650\u064A\u0646\u064E\u0626\u0650\u0630\u0656 \u062A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 85, text: "\u0648\u064E\u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0642\u06E1\u0631\u064E\u0628\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0644\u0651\u064E\u0627 \u062A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 86, text: "\u0641\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064E\u062F\u0650\u064A\u0646\u0650\u064A\u0646\u064E" }, { id: 87, text: "\u062A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0646\u064E\u0647\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 88, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0631\u0651\u064E\u0628\u0650\u064A\u0646\u064E" }, { id: 89, text: "\u0641\u064E\u0631\u064E\u0648\u06E1\u062D\u065E \u0648\u064E\u0631\u064E\u064A\u06E1\u062D\u064E\u0627\u0646\u065E \u0648\u064E\u062C\u064E\u0646\u0651\u064E\u062A\u064F \u0646\u064E\u0639\u0650\u064A\u0645\u0656" }, { id: 90, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650" }, { id: 91, text: "\u0641\u064E\u0633\u064E\u0644\u064E\u0670\u0645\u065E \u0644\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650" }, { id: 92, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627\u0653 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E \u0671\u0644\u0636\u0651\u064E\u0627\u0653\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 93, text: "\u0641\u064E\u0646\u064F\u0632\u064F\u0644\u065E \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u0645\u0650\u064A\u0645\u0656" }, { id: 94, text: "\u0648\u064E\u062A\u064E\u0635\u06E1\u0644\u0650\u064A\u064E\u0629\u064F \u062C\u064E\u062D\u0650\u064A\u0645\u064D" }, { id: 95, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0647\u064F\u0648\u064E \u062D\u064E\u0642\u0651\u064F \u0671\u0644\u06E1\u064A\u064E\u0642\u0650\u064A\u0646\u0650" }, { id: 96, text: "\u0641\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u0671\u0633\u06E1\u0645\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }] }, { id: 57, name: "\u0627\u0644\u062D\u062F\u064A\u062F", transliteration: "Al-Hadid", type: "medinan", total_verses: 29, verses: [{ id: 1, text: "\u0633\u064E\u0628\u0651\u064E\u062D\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 2, text: "\u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u064A\u064F\u062D\u06E1\u064A\u0650\u06E6 \u0648\u064E\u064A\u064F\u0645\u0650\u064A\u062A\u064F\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 3, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u064F \u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064F \u0648\u064E\u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0647\u0650\u0631\u064F \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u0627\u0637\u0650\u0646\u064F\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 4, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0641\u0650\u064A \u0633\u0650\u062A\u0651\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0656 \u062B\u064F\u0645\u0651\u064E \u0671\u0633\u06E1\u062A\u064E\u0648\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650\u06D6 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u064A\u064E\u0644\u0650\u062C\u064F \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0646\u0632\u0650\u0644\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0631\u064F\u062C\u064F \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u06E1\u0646\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 5, text: "\u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064F\u0631\u06E1\u062C\u064E\u0639\u064F \u0671\u0644\u06E1\u0623\u064F\u0645\u064F\u0648\u0631\u064F" }, { id: 6, text: "\u064A\u064F\u0648\u0644\u0650\u062C\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0648\u064E\u064A\u064F\u0648\u0644\u0650\u062C\u064F \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0641\u0650\u064A \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 7, text: "\u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0645\u0651\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u062E\u06E1\u0644\u064E\u0641\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u0650\u06D6 \u0641\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u065E \u0643\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 8, text: "\u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0643\u064F\u0645\u06E1 \u0644\u0650\u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u062E\u064E\u0630\u064E \u0645\u0650\u064A\u062B\u064E\u0670\u0642\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0646\u064E\u0632\u0651\u0650\u0644\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u0628\u06E1\u062F\u0650\u0647\u0650\u06E6\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u06ED \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064F\u0648\u0631\u0650\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0643\u064F\u0645\u06E1 \u0644\u064E\u0631\u064E\u0621\u064F\u0648\u0641\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 10, text: "\u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0644\u0651\u064E\u0627 \u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u064A\u0631\u064E\u0670\u062B\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0646\u06E1 \u0623\u064E\u0646\u0641\u064E\u0642\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0641\u064E\u062A\u06E1\u062D\u0650 \u0648\u064E\u0642\u064E\u0670\u062A\u064E\u0644\u064E\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0639\u06E1\u0638\u064E\u0645\u064F \u062F\u064E\u0631\u064E\u062C\u064E\u0629\u0657 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u064F \u0648\u064E\u0642\u064E\u0670\u062A\u064E\u0644\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0643\u064F\u0644\u0651\u0657\u0627 \u0648\u064E\u0639\u064E\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 11, text: "\u0645\u0651\u064E\u0646 \u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0642\u06E1\u0631\u0650\u0636\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u0631\u06E1\u0636\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627 \u0641\u064E\u064A\u064F\u0636\u064E\u0670\u0639\u0650\u0641\u064E\u0647\u064F\u06E5 \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062C\u06E1\u0631\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u065E" }, { id: 12, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u064A\u064E\u0633\u06E1\u0639\u064E\u0649\u0670 \u0646\u064F\u0648\u0631\u064F\u0647\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0628\u0650\u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06D6 \u0628\u064F\u0634\u06E1\u0631\u064E\u0649\u0670\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u065E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 13, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064E\u0670\u062A\u064F \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E\u0627 \u0646\u064E\u0642\u06E1\u062A\u064E\u0628\u0650\u0633\u06E1 \u0645\u0650\u0646 \u0646\u0651\u064F\u0648\u0631\u0650\u0643\u064F\u0645\u06E1 \u0642\u0650\u064A\u0644\u064E \u0671\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0627\u0652 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u0644\u06E1\u062A\u064E\u0645\u0650\u0633\u064F\u0648\u0627\u0652 \u0646\u064F\u0648\u0631\u0657\u0627\u06D6 \u0641\u064E\u0636\u064F\u0631\u0650\u0628\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645 \u0628\u0650\u0633\u064F\u0648\u0631\u0656 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0628\u064E\u0627\u0628\u064F\u06E2 \u0628\u064E\u0627\u0637\u0650\u0646\u064F\u0647\u064F\u06E5 \u0641\u0650\u064A\u0647\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0629\u064F \u0648\u064E\u0638\u064E\u0670\u0647\u0650\u0631\u064F\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0642\u0650\u0628\u064E\u0644\u0650\u0647\u0650 \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F" }, { id: 14, text: "\u064A\u064F\u0646\u064E\u0627\u062F\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u0643\u064F\u0646 \u0645\u0651\u064E\u0639\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u062A\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u062A\u064E\u0631\u064E\u0628\u0651\u064E\u0635\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0671\u0631\u06E1\u062A\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u063A\u064E\u0631\u0651\u064E\u062A\u06E1\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u064E\u0627\u0646\u0650\u064A\u0651\u064F \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0645\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u063A\u064E\u0631\u0651\u064E\u0643\u064F\u0645 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u063A\u064E\u0631\u064F\u0648\u0631\u064F" }, { id: 15, text: "\u0641\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u062E\u064E\u0630\u064F \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0641\u0650\u062F\u06E1\u064A\u064E\u0629\u065E \u0648\u064E\u0644\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652\u06DA \u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0643\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064F\u06D6 \u0647\u0650\u064A\u064E \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 16, text: "\u06DE\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u0646\u0650 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u062A\u064E\u062E\u06E1\u0634\u064E\u0639\u064E \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0644\u0650\u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u0632\u064E\u0644\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0641\u064E\u0637\u064E\u0627\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u064E\u062F\u064F \u0641\u064E\u0642\u064E\u0633\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0643\u064E\u062B\u0650\u064A\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u06E1\u064A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0645\u064E\u0648\u06E1\u062A\u0650\u0647\u064E\u0627\u06DA \u0642\u064E\u062F\u06E1 \u0628\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0670\u062A\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0635\u0651\u064E\u062F\u0651\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0635\u0651\u064E\u062F\u0651\u0650\u0642\u064E\u0670\u062A\u0650 \u0648\u064E\u0623\u064E\u0642\u06E1\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u0631\u06E1\u0636\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627 \u064A\u064F\u0636\u064E\u0670\u0639\u064E\u0641\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u065E \u0643\u064E\u0631\u0650\u064A\u0645\u065E" }, { id: 19, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u0650\u062F\u0651\u0650\u064A\u0642\u064F\u0648\u0646\u064E\u06D6 \u0648\u064E\u0671\u0644\u0634\u0651\u064F\u0647\u064E\u062F\u064E\u0627\u0653\u0621\u064F \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0646\u064F\u0648\u0631\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 20, text: "\u0671\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0644\u064E\u0639\u0650\u0628\u065E \u0648\u064E\u0644\u064E\u0647\u06E1\u0648\u065E \u0648\u064E\u0632\u0650\u064A\u0646\u064E\u0629\u065E \u0648\u064E\u062A\u064E\u0641\u064E\u0627\u062E\u064F\u0631\u064F\u06E2 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u062A\u064E\u0643\u064E\u0627\u062B\u064F\u0631\u065E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u0650\u06D6 \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u063A\u064E\u064A\u06E1\u062B\u064D \u0623\u064E\u0639\u06E1\u062C\u064E\u0628\u064E \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064E \u0646\u064E\u0628\u064E\u0627\u062A\u064F\u0647\u064F\u06E5 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0647\u0650\u064A\u062C\u064F \u0641\u064E\u062A\u064E\u0631\u064E\u0649\u0670\u0647\u064F \u0645\u064F\u0635\u06E1\u0641\u064E\u0631\u0651\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u062D\u064F\u0637\u064E\u0670\u0645\u0657\u0627\u06D6 \u0648\u064E\u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u065E \u0648\u064E\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u065E\u06DA \u0648\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064F \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u062A\u064E\u0670\u0639\u064F \u0671\u0644\u06E1\u063A\u064F\u0631\u064F\u0648\u0631\u0650" }, { id: 21, text: "\u0633\u064E\u0627\u0628\u0650\u0642\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u062C\u064E\u0646\u0651\u064E\u0629\u064D \u0639\u064E\u0631\u06E1\u0636\u064F\u0647\u064E\u0627 \u0643\u064E\u0639\u064E\u0631\u06E1\u0636\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064F\u0639\u0650\u062F\u0651\u064E\u062A\u06E1 \u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u0647\u0650 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0630\u064F\u0648 \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 22, text: "\u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E \u0645\u0650\u0646 \u0645\u0651\u064F\u0635\u0650\u064A\u0628\u064E\u0629\u0656 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0643\u0650\u062A\u064E\u0670\u0628\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u0646\u0651\u064E\u0628\u06E1\u0631\u064E\u0623\u064E\u0647\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0633\u0650\u064A\u0631\u065E" }, { id: 23, text: "\u0644\u0651\u0650\u0643\u064E\u064A\u06E1\u0644\u064E\u0627 \u062A\u064E\u0623\u06E1\u0633\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0641\u064E\u0627\u062A\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0641\u06E1\u0631\u064E\u062D\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0643\u064F\u0644\u0651\u064E \u0645\u064F\u062E\u06E1\u062A\u064E\u0627\u0644\u0656 \u0641\u064E\u062E\u064F\u0648\u0631\u064D" }, { id: 24, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0628\u06E1\u062E\u064E\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u064A\u064E\u0623\u06E1\u0645\u064F\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u0628\u0650\u0671\u0644\u06E1\u0628\u064F\u062E\u06E1\u0644\u0650\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0646\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u062F\u064F" }, { id: 25, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0631\u064F\u0633\u064F\u0644\u064E\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u0650\u064A\u0632\u064E\u0627\u0646\u064E \u0644\u0650\u064A\u064E\u0642\u064F\u0648\u0645\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0628\u0650\u0671\u0644\u06E1\u0642\u0650\u0633\u06E1\u0637\u0650\u06D6 \u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u062F\u0650\u064A\u062F\u064E \u0641\u0650\u064A\u0647\u0650 \u0628\u064E\u0623\u06E1\u0633\u065E \u0634\u064E\u062F\u0650\u064A\u062F\u065E \u0648\u064E\u0645\u064E\u0646\u064E\u0670\u0641\u0650\u0639\u064F \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0648\u064E\u0644\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0646 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0647\u064F\u06E5 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u0648\u0650\u064A\u0651\u064C \u0639\u064E\u0632\u0650\u064A\u0632\u065E" }, { id: 26, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0646\u064F\u0648\u062D\u0657\u0627 \u0648\u064E\u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0630\u064F\u0631\u0651\u0650\u064A\u0651\u064E\u062A\u0650\u0647\u0650\u0645\u064E\u0627 \u0671\u0644\u0646\u0651\u064F\u0628\u064F\u0648\u0651\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E\u06D6 \u0641\u064E\u0645\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064F\u0647\u06E1\u062A\u064E\u062F\u0656\u06D6 \u0648\u064E\u0643\u064E\u062B\u0650\u064A\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u062B\u064F\u0645\u0651\u064E \u0642\u064E\u0641\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u062B\u064E\u0670\u0631\u0650\u0647\u0650\u0645 \u0628\u0650\u0631\u064F\u0633\u064F\u0644\u0650\u0646\u064E\u0627 \u0648\u064E\u0642\u064E\u0641\u0651\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u0650\u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u0650 \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u062C\u0650\u064A\u0644\u064E\u06D6 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0647\u064F \u0631\u064E\u0623\u06E1\u0641\u064E\u0629\u0657 \u0648\u064E\u0631\u064E\u062D\u06E1\u0645\u064E\u0629\u0657\u06DA \u0648\u064E\u0631\u064E\u0647\u06E1\u0628\u064E\u0627\u0646\u0650\u064A\u0651\u064E\u0629\u064B \u0671\u0628\u06E1\u062A\u064E\u062F\u064E\u0639\u064F\u0648\u0647\u064E\u0627 \u0645\u064E\u0627 \u0643\u064E\u062A\u064E\u0628\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0645\u064E\u0627 \u0631\u064E\u0639\u064E\u0648\u06E1\u0647\u064E\u0627 \u062D\u064E\u0642\u0651\u064E \u0631\u0650\u0639\u064E\u0627\u064A\u064E\u062A\u0650\u0647\u064E\u0627\u06D6 \u0641\u064E\u0640\u0654\u064E\u0627\u062A\u064E\u064A\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0643\u064E\u062B\u0650\u064A\u0631\u065E \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0621\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u064A\u064F\u0624\u06E1\u062A\u0650\u0643\u064F\u0645\u06E1 \u0643\u0650\u0641\u06E1\u0644\u064E\u064A\u06E1\u0646\u0650 \u0645\u0650\u0646 \u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0646\u064F\u0648\u0631\u0657\u0627 \u062A\u064E\u0645\u06E1\u0634\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 29, text: "\u0644\u0651\u0650\u0626\u064E\u0644\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0623\u064E\u0647\u06E1\u0644\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0623\u064E\u0644\u0651\u064E\u0627 \u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0645\u0651\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u064E \u0628\u0650\u064A\u064E\u062F\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u0647\u0650 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0630\u064F\u0648 \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }] }, { id: 58, name: "\u0627\u0644\u0645\u062C\u0627\u062F\u0644\u0629", transliteration: "Al-Mujadila", type: "medinan", total_verses: 22, verses: [{ id: 1, text: "\u0642\u064E\u062F\u06E1 \u0633\u064E\u0645\u0650\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064E\u0648\u06E1\u0644\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062A\u064F\u062C\u064E\u0670\u062F\u0650\u0644\u064F\u0643\u064E \u0641\u0650\u064A \u0632\u064E\u0648\u06E1\u062C\u0650\u0647\u064E\u0627 \u0648\u064E\u062A\u064E\u0634\u06E1\u062A\u064E\u0643\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u062A\u064E\u062D\u064E\u0627\u0648\u064F\u0631\u064E\u0643\u064F\u0645\u064E\u0627\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0633\u064E\u0645\u0650\u064A\u0639\u064F\u06E2 \u0628\u064E\u0635\u0650\u064A\u0631\u064C" }, { id: 2, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0638\u064E\u0670\u0647\u0650\u0631\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0647\u064F\u0646\u0651\u064E \u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0625\u0650\u0646\u06E1 \u0623\u064F\u0645\u0651\u064E\u0647\u064E\u0670\u062A\u064F\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0640\u0670\u0653\u0640\u0654\u0650\u064A \u0648\u064E\u0644\u064E\u062F\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064F\u0646\u0643\u064E\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0644\u0650 \u0648\u064E\u0632\u064F\u0648\u0631\u0657\u0627\u06DA \u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0639\u064E\u0641\u064F\u0648\u0651\u064C \u063A\u064E\u0641\u064F\u0648\u0631\u065E" }, { id: 3, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0638\u064E\u0670\u0647\u0650\u0631\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0639\u064F\u0648\u062F\u064F\u0648\u0646\u064E \u0644\u0650\u0645\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0641\u064E\u062A\u064E\u062D\u06E1\u0631\u0650\u064A\u0631\u064F \u0631\u064E\u0642\u064E\u0628\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064E\u062A\u064E\u0645\u064E\u0627\u0653\u0633\u0651\u064E\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u062A\u064F\u0648\u0639\u064E\u0638\u064F\u0648\u0646\u064E \u0628\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 4, text: "\u0641\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u062C\u0650\u062F\u06E1 \u0641\u064E\u0635\u0650\u064A\u064E\u0627\u0645\u064F \u0634\u064E\u0647\u06E1\u0631\u064E\u064A\u06E1\u0646\u0650 \u0645\u064F\u062A\u064E\u062A\u064E\u0627\u0628\u0650\u0639\u064E\u064A\u06E1\u0646\u0650 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064E\u062A\u064E\u0645\u064E\u0627\u0653\u0633\u0651\u064E\u0627\u06D6 \u0641\u064E\u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u0639\u06E1 \u0641\u064E\u0625\u0650\u0637\u06E1\u0639\u064E\u0627\u0645\u064F \u0633\u0650\u062A\u0651\u0650\u064A\u0646\u064E \u0645\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u0657\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u062D\u064F\u062F\u064F\u0648\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 5, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062D\u064E\u0627\u0653\u062F\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0643\u064F\u0628\u0650\u062A\u064F\u0648\u0627\u0652 \u0643\u064E\u0645\u064E\u0627 \u0643\u064F\u0628\u0650\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u06ED \u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656\u06DA \u0648\u064E\u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u065E" }, { id: 6, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0641\u064E\u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0653\u0627\u0652\u06DA \u0623\u064E\u062D\u06E1\u0635\u064E\u0649\u0670\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0646\u064E\u0633\u064F\u0648\u0647\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u064C" }, { id: 7, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0645\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0645\u0650\u0646 \u0646\u0651\u064E\u062C\u06E1\u0648\u064E\u0649\u0670 \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0631\u064E\u0627\u0628\u0650\u0639\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062E\u064E\u0645\u06E1\u0633\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0633\u064E\u0627\u062F\u0650\u0633\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670 \u0645\u0650\u0646 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u064A\u06E1\u0646\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652\u06D6 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 8, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0646\u064F\u0647\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u0650 \u0671\u0644\u0646\u0651\u064E\u062C\u06E1\u0648\u064E\u0649\u0670 \u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0639\u064F\u0648\u062F\u064F\u0648\u0646\u064E \u0644\u0650\u0645\u064E\u0627 \u0646\u064F\u0647\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F \u0648\u064E\u064A\u064E\u062A\u064E\u0646\u064E\u0670\u062C\u064E\u0648\u06E1\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064F\u062F\u06E1\u0648\u064E\u0670\u0646\u0650 \u0648\u064E\u0645\u064E\u0639\u06E1\u0635\u0650\u064A\u064E\u062A\u0650 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650\u06D6 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064F\u0648\u0643\u064E \u062D\u064E\u064A\u0651\u064E\u0648\u06E1\u0643\u064E \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064F\u062D\u064E\u064A\u0651\u0650\u0643\u064E \u0628\u0650\u0647\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0646\u064E\u0627 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u0646\u064E\u0642\u064F\u0648\u0644\u064F\u06DA \u062D\u064E\u0633\u06E1\u0628\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F \u064A\u064E\u0635\u06E1\u0644\u064E\u0648\u06E1\u0646\u064E\u0647\u064E\u0627\u06D6 \u0641\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 9, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u0646\u064E\u0670\u062C\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062A\u064E\u0646\u064E\u0670\u062C\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u062B\u06E1\u0645\u0650 \u0648\u064E\u0671\u0644\u06E1\u0639\u064F\u062F\u06E1\u0648\u064E\u0670\u0646\u0650 \u0648\u064E\u0645\u064E\u0639\u06E1\u0635\u0650\u064A\u064E\u062A\u0650 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0648\u064E\u062A\u064E\u0646\u064E\u0670\u062C\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0628\u0650\u0631\u0651\u0650 \u0648\u064E\u0671\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u062C\u06E1\u0648\u064E\u0649\u0670 \u0645\u0650\u0646\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0644\u0650\u064A\u064E\u062D\u06E1\u0632\u064F\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0628\u0650\u0636\u064E\u0627\u0653\u0631\u0651\u0650\u0647\u0650\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0641\u064E\u0633\u0651\u064E\u062D\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u062C\u064E\u0670\u0644\u0650\u0633\u0650 \u0641\u064E\u0671\u0641\u06E1\u0633\u064E\u062D\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0633\u064E\u062D\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0671\u0646\u0634\u064F\u0632\u064F\u0648\u0627\u0652 \u0641\u064E\u0671\u0646\u0634\u064F\u0632\u064F\u0648\u0627\u0652 \u064A\u064E\u0631\u06E1\u0641\u064E\u0639\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064E \u062F\u064E\u0631\u064E\u062C\u064E\u0670\u062A\u0656\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 12, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0646\u064E\u0670\u062C\u064E\u064A\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0641\u064E\u0642\u064E\u062F\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1 \u0646\u064E\u062C\u06E1\u0648\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0635\u064E\u062F\u064E\u0642\u064E\u0629\u0657\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0637\u06E1\u0647\u064E\u0631\u064F\u06DA \u0641\u064E\u0625\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u062A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 13, text: "\u0621\u064E\u0623\u064E\u0634\u06E1\u0641\u064E\u0642\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064F\u0642\u064E\u062F\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u06E1 \u0646\u064E\u062C\u06E1\u0648\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0635\u064E\u062F\u064E\u0642\u064E\u0670\u062A\u0656\u06DA \u0641\u064E\u0625\u0650\u0630\u06E1 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u0627\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u06DE\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064B\u0627 \u063A\u064E\u0636\u0650\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u064B\u0627\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u0647\u064F\u0645\u06E1 \u062C\u064F\u0646\u0651\u064E\u0629\u0657 \u0641\u064E\u0635\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u065E \u0645\u0651\u064F\u0647\u0650\u064A\u0646\u065E" }, { id: 17, text: "\u0644\u0651\u064E\u0646 \u062A\u064F\u063A\u06E1\u0646\u0650\u064A\u064E \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064F\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u064B\u0627\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650\u06D6 \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u062E\u064E\u0670\u0644\u0650\u062F\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0641\u064E\u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u06E5 \u0643\u064E\u0645\u064E\u0627 \u064A\u064E\u062D\u06E1\u0644\u0650\u0641\u064F\u0648\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0634\u064E\u064A\u06E1\u0621\u064D\u06DA \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0671\u0633\u06E1\u062A\u064E\u062D\u06E1\u0648\u064E\u0630\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u064F \u0641\u064E\u0623\u064E\u0646\u0633\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0630\u0650\u0643\u06E1\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u062D\u0650\u0632\u06E1\u0628\u064F \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650\u06DA \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u062D\u0650\u0632\u06E1\u0628\u064E \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u062D\u064E\u0627\u0653\u062F\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0630\u064E\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 21, text: "\u0643\u064E\u062A\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0623\u064E\u063A\u06E1\u0644\u0650\u0628\u064E\u0646\u0651\u064E \u0623\u064E\u0646\u064E\u0627\u06E0 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u064A\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u0648\u0650\u064A\u0651\u064C \u0639\u064E\u0632\u0650\u064A\u0632\u065E" }, { id: 22, text: "\u0644\u0651\u064E\u0627 \u062A\u064E\u062C\u0650\u062F\u064F \u0642\u064E\u0648\u06E1\u0645\u0657\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650 \u064A\u064F\u0648\u064E\u0627\u0653\u062F\u0651\u064F\u0648\u0646\u064E \u0645\u064E\u0646\u06E1 \u062D\u064E\u0627\u0653\u062F\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0653\u0627\u0652 \u0621\u064E\u0627\u0628\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0623\u064E\u0628\u06E1\u0646\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0639\u064E\u0634\u0650\u064A\u0631\u064E\u062A\u064E\u0647\u064F\u0645\u06E1\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0643\u064E\u062A\u064E\u0628\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064E \u0648\u064E\u0623\u064E\u064A\u0651\u064E\u062F\u064E\u0647\u064F\u0645 \u0628\u0650\u0631\u064F\u0648\u062D\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u06D6 \u0648\u064E\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0631\u064E\u0636\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u062D\u0650\u0632\u06E1\u0628\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0623\u064E\u0644\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u062D\u0650\u0632\u06E1\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }] }, { id: 59, name: "\u0627\u0644\u062D\u0634\u0631", transliteration: "Al-Hashr", type: "medinan", total_verses: 24, verses: [{ id: 1, text: "\u0633\u064E\u0628\u0651\u064E\u062D\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 2, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0645\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u0644\u0650\u0623\u064E\u0648\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u062D\u064E\u0634\u06E1\u0631\u0650\u06DA \u0645\u064E\u0627 \u0638\u064E\u0646\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0638\u064E\u0646\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0627\u0646\u0650\u0639\u064E\u062A\u064F\u0647\u064F\u0645\u06E1 \u062D\u064F\u0635\u064F\u0648\u0646\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0623\u064E\u062A\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0644\u064E\u0645\u06E1 \u064A\u064E\u062D\u06E1\u062A\u064E\u0633\u0650\u0628\u064F\u0648\u0627\u0652\u06D6 \u0648\u064E\u0642\u064E\u0630\u064E\u0641\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0631\u0651\u064F\u0639\u06E1\u0628\u064E\u06DA \u064A\u064F\u062E\u06E1\u0631\u0650\u0628\u064F\u0648\u0646\u064E \u0628\u064F\u064A\u064F\u0648\u062A\u064E\u0647\u064F\u0645 \u0628\u0650\u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u064A\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0641\u064E\u0671\u0639\u06E1\u062A\u064E\u0628\u0650\u0631\u064F\u0648\u0627\u0652 \u064A\u064E\u0640\u0670\u0653\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650" }, { id: 3, text: "\u0648\u064E\u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u0643\u064E\u062A\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u062C\u064E\u0644\u064E\u0627\u0653\u0621\u064E \u0644\u064E\u0639\u064E\u0630\u0651\u064E\u0628\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627\u06D6 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650" }, { id: 4, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0634\u064E\u0627\u0653\u0642\u0651\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5\u06D6 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0634\u064E\u0627\u0653\u0642\u0651\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 5, text: "\u0645\u064E\u0627 \u0642\u064E\u0637\u064E\u0639\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0644\u0651\u0650\u064A\u0646\u064E\u0629\u064D \u0623\u064E\u0648\u06E1 \u062A\u064E\u0631\u064E\u0643\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064E\u0627 \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u064E\u0629\u064B \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064F\u0635\u064F\u0648\u0644\u0650\u0647\u064E\u0627 \u0641\u064E\u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u064A\u064F\u062E\u06E1\u0632\u0650\u064A\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 6, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0641\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0641\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u062C\u064E\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0645\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0644\u0656 \u0648\u064E\u0644\u064E\u0627 \u0631\u0650\u0643\u064E\u0627\u0628\u0656 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0633\u064E\u0644\u0651\u0650\u0637\u064F \u0631\u064F\u0633\u064F\u0644\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 7, text: "\u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0641\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0642\u064F\u0631\u064E\u0649\u0670 \u0641\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0644\u0650\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0650 \u0648\u064E\u0644\u0650\u0630\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0628\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u062A\u064E\u0670\u0645\u064E\u0649\u0670 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u064A\u0646\u0650 \u0648\u064E\u0671\u0628\u06E1\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650 \u0643\u064E\u064A\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0643\u064F\u0648\u0646\u064E \u062F\u064F\u0648\u0644\u064E\u0629\u064E\u06E2 \u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u063A\u06E1\u0646\u0650\u064A\u064E\u0627\u0653\u0621\u0650 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0643\u064F\u0645\u064F \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064F \u0641\u064E\u062E\u064F\u0630\u064F\u0648\u0647\u064F \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u0647\u064E\u0649\u0670\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F \u0641\u064E\u0671\u0646\u062A\u064E\u0647\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0634\u064E\u062F\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0639\u0650\u0642\u064E\u0627\u0628\u0650" }, { id: 8, text: "\u0644\u0650\u0644\u06E1\u0641\u064F\u0642\u064E\u0631\u064E\u0627\u0653\u0621\u0650 \u0671\u0644\u06E1\u0645\u064F\u0647\u064E\u0670\u062C\u0650\u0631\u0650\u064A\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0646\u064E \u0641\u064E\u0636\u06E1\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u0650\u0636\u06E1\u0648\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5\u0653\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u062F\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062A\u064E\u0628\u064E\u0648\u0651\u064E\u0621\u064F\u0648 \u0671\u0644\u062F\u0651\u064E\u0627\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0645\u064E\u0646\u06E1 \u0647\u064E\u0627\u062C\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u0627\u062C\u064E\u0629\u0657 \u0645\u0651\u0650\u0645\u0651\u064E\u0627\u0653 \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064F\u0624\u06E1\u062B\u0650\u0631\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0647\u0650\u0645\u06E1 \u062E\u064E\u0635\u064E\u0627\u0635\u064E\u0629\u065E\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0648\u0642\u064E \u0634\u064F\u062D\u0651\u064E \u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062C\u064E\u0627\u0653\u0621\u064F\u0648 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0648\u064E\u0644\u0650\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0633\u064E\u0628\u064E\u0642\u064F\u0648\u0646\u064E\u0627 \u0628\u0650\u0671\u0644\u06E1\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0646\u064E\u0627 \u063A\u0650\u0644\u0651\u0657\u0627 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0631\u064E\u0621\u064F\u0648\u0641\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 11, text: "\u06DE\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0646\u064E\u0627\u0641\u064E\u0642\u064F\u0648\u0627\u0652 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u0650\u0625\u0650\u062E\u06E1\u0648\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064F\u062E\u06E1\u0631\u0650\u062C\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0646\u064E\u062E\u06E1\u0631\u064F\u062C\u064E\u0646\u0651\u064E \u0645\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0646\u064F\u0637\u0650\u064A\u0639\u064F \u0641\u0650\u064A\u0643\u064F\u0645\u06E1 \u0623\u064E\u062D\u064E\u062F\u064B\u0627 \u0623\u064E\u0628\u064E\u062F\u0657\u0627 \u0648\u064E\u0625\u0650\u0646 \u0642\u064F\u0648\u062A\u0650\u0644\u06E1\u062A\u064F\u0645\u06E1 \u0644\u064E\u0646\u064E\u0646\u0635\u064F\u0631\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u0644\u064E\u0626\u0650\u0646\u06E1 \u0623\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0646\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0642\u064F\u0648\u062A\u0650\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0626\u0650\u0646 \u0646\u0651\u064E\u0635\u064E\u0631\u064F\u0648\u0647\u064F\u0645\u06E1 \u0644\u064E\u064A\u064F\u0648\u064E\u0644\u0651\u064F\u0646\u0651\u064E \u0671\u0644\u06E1\u0623\u064E\u062F\u06E1\u0628\u064E\u0670\u0631\u064E \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064F\u0646\u0635\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0644\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0631\u064E\u0647\u06E1\u0628\u064E\u0629\u0657 \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u0644\u064E\u0627 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E\u0643\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0642\u064F\u0631\u0657\u0649 \u0645\u0651\u064F\u062D\u064E\u0635\u0651\u064E\u0646\u064E\u0629\u064D \u0623\u064E\u0648\u06E1 \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u0650 \u062C\u064F\u062F\u064F\u0631\u0650\u06ED\u06DA \u0628\u064E\u0623\u06E1\u0633\u064F\u0647\u064F\u0645 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u06E1 \u0634\u064E\u062F\u0650\u064A\u062F\u065E\u06DA \u062A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0647\u064F\u0645\u06E1 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u0648\u064E\u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0647\u064F\u0645\u06E1 \u0634\u064E\u062A\u0651\u064E\u0649\u0670\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0642\u064E\u0648\u06E1\u0645\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0642\u0650\u0644\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0631\u0650\u064A\u0628\u0657\u0627\u06D6 \u0630\u064E\u0627\u0642\u064F\u0648\u0627\u0652 \u0648\u064E\u0628\u064E\u0627\u0644\u064E \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 16, text: "\u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u0671\u0644\u0634\u0651\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0650 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0644\u0650\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u0650 \u0671\u0643\u06E1\u0641\u064F\u0631\u06E1 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0643\u064E\u0641\u064E\u0631\u064E \u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0628\u064E\u0631\u0650\u064A\u0653\u0621\u065E \u0645\u0651\u0650\u0646\u0643\u064E \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u062E\u064E\u0627\u0641\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u064E \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u0641\u064E\u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u062A\u064E\u0647\u064F\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u062E\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u06E1\u0646\u0650 \u0641\u0650\u064A\u0647\u064E\u0627\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062C\u064E\u0632\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0644\u06E1\u062A\u064E\u0646\u0638\u064F\u0631\u06E1 \u0646\u064E\u0641\u06E1\u0633\u065E \u0645\u0651\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0644\u0650\u063A\u064E\u062F\u0656\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0643\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0646\u064E\u0633\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u064E\u0623\u064E\u0646\u0633\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0647\u064F\u0645\u06E1\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u0650\u064A\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0648\u064E\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650\u06DA \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0627\u0653\u0626\u0650\u0632\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0644\u064E\u0648\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u062C\u064E\u0628\u064E\u0644\u0656 \u0644\u0651\u064E\u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E\u0647\u064F\u06E5 \u062E\u064E\u0670\u0634\u0650\u0639\u0657\u0627 \u0645\u0651\u064F\u062A\u064E\u0635\u064E\u062F\u0651\u0650\u0639\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u0634\u06E1\u064A\u064E\u0629\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u064F \u0646\u064E\u0636\u06E1\u0631\u0650\u0628\u064F\u0647\u064E\u0627 \u0644\u0650\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u0641\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06D6 \u0639\u064E\u0670\u0644\u0650\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650\u06D6 \u0647\u064F\u0648\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F" }, { id: 23, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0645\u064E\u0644\u0650\u0643\u064F \u0671\u0644\u06E1\u0642\u064F\u062F\u0651\u064F\u0648\u0633\u064F \u0671\u0644\u0633\u0651\u064E\u0644\u064E\u0670\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0671\u0644\u06E1\u0645\u064F\u0647\u064E\u064A\u06E1\u0645\u0650\u0646\u064F \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062C\u064E\u0628\u0651\u064E\u0627\u0631\u064F \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0643\u064E\u0628\u0651\u0650\u0631\u064F\u06DA \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0639\u064E\u0645\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0644\u0650\u0642\u064F \u0671\u0644\u06E1\u0628\u064E\u0627\u0631\u0650\u0626\u064F \u0671\u0644\u06E1\u0645\u064F\u0635\u064E\u0648\u0651\u0650\u0631\u064F\u06D6 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0623\u064E\u0633\u06E1\u0645\u064E\u0627\u0653\u0621\u064F \u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670\u06DA \u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }] }, { id: 60, name: "\u0627\u0644\u0645\u0645\u062A\u062D\u0646\u0629", transliteration: "Al-Mumtahanah", type: "medinan", total_verses: 13, verses: [{ id: 1, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062A\u0651\u064E\u062E\u0650\u0630\u064F\u0648\u0627\u0652 \u0639\u064E\u062F\u064F\u0648\u0651\u0650\u064A \u0648\u064E\u0639\u064E\u062F\u064F\u0648\u0651\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064E \u062A\u064F\u0644\u06E1\u0642\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0648\u064E\u062F\u0651\u064E\u0629\u0650 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0646\u064E \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0648\u064E\u0625\u0650\u064A\u0651\u064E\u0627\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062E\u064E\u0631\u064E\u062C\u06E1\u062A\u064F\u0645\u06E1 \u062C\u0650\u0647\u064E\u0670\u062F\u0657\u0627 \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u064A \u0648\u064E\u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0631\u06E1\u0636\u064E\u0627\u062A\u0650\u064A\u06DA \u062A\u064F\u0633\u0650\u0631\u0651\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0648\u064E\u062F\u0651\u064E\u0629\u0650 \u0648\u064E\u0623\u064E\u0646\u064E\u0627\u06E0 \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u062E\u06E1\u0641\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0646\u062A\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u06E1\u0647\u064F \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0636\u064E\u0644\u0651\u064E \u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u0650" }, { id: 2, text: "\u0625\u0650\u0646 \u064A\u064E\u062B\u06E1\u0642\u064E\u0641\u064F\u0648\u0643\u064F\u0645\u06E1 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u062F\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u064A\u064E\u0628\u06E1\u0633\u064F\u0637\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0644\u06E1\u0633\u0650\u0646\u064E\u062A\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u0633\u0651\u064F\u0648\u0653\u0621\u0650 \u0648\u064E\u0648\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u062A\u064E\u0643\u06E1\u0641\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0644\u064E\u0646 \u062A\u064E\u0646\u0641\u064E\u0639\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0631\u06E1\u062D\u064E\u0627\u0645\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064F\u0643\u064F\u0645\u06E1\u06DA \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u064A\u064E\u0641\u06E1\u0635\u0650\u0644\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u065E" }, { id: 4, text: "\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064F\u0633\u06E1\u0648\u064E\u0629\u064C \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u065E \u0641\u0650\u064A\u0653 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u064E\u0639\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0627 \u0628\u064F\u0631\u064E\u0621\u064E\u0640\u0670\u0653\u0624\u064F\u0627\u0652 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0645\u0650\u0645\u0651\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0641\u064E\u0631\u06E1\u0646\u064E\u0627 \u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u062F\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0646\u064E\u0627 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u062F\u064E\u0670\u0648\u064E\u0629\u064F \u0648\u064E\u0671\u0644\u06E1\u0628\u064E\u063A\u06E1\u0636\u064E\u0627\u0653\u0621\u064F \u0623\u064E\u0628\u064E\u062F\u064B\u0627 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u062D\u06E1\u062F\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0648\u06E1\u0644\u064E \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0644\u0650\u0623\u064E\u0628\u0650\u064A\u0647\u0650 \u0644\u064E\u0623\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0646\u0651\u064E \u0644\u064E\u0643\u064E \u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0644\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u0656\u06D6 \u0631\u0651\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0623\u064E\u0646\u064E\u0628\u06E1\u0646\u064E\u0627 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 5, text: "\u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0623\u064E\u0646\u062A\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 6, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650\u0645\u06E1 \u0623\u064F\u0633\u06E1\u0648\u064E\u0629\u064C \u062D\u064E\u0633\u064E\u0646\u064E\u0629\u065E \u0644\u0651\u0650\u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0646\u0650\u064A\u0651\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u062F\u064F" }, { id: 7, text: "\u06DE\u0639\u064E\u0633\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064E \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0628\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0639\u064E\u0627\u062F\u064E\u064A\u06E1\u062A\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645 \u0645\u0651\u064E\u0648\u064E\u062F\u0651\u064E\u0629\u0657\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064E\u062F\u0650\u064A\u0631\u065E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 8, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0646\u06E1\u0647\u064E\u0649\u0670\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0644\u064E\u0645\u06E1 \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0628\u064E\u0631\u0651\u064F\u0648\u0647\u064F\u0645\u06E1 \u0648\u064E\u062A\u064F\u0642\u06E1\u0633\u0650\u0637\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u0642\u06E1\u0633\u0650\u0637\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u064A\u064E\u0646\u06E1\u0647\u064E\u0649\u0670\u0643\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0642\u064E\u0670\u062A\u064E\u0644\u064F\u0648\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0648\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064F\u0648\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u0650\u064A\u064E\u0670\u0631\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0638\u064E\u0670\u0647\u064E\u0631\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0625\u0650\u062E\u06E1\u0631\u064E\u0627\u062C\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u064F \u0645\u064F\u0647\u064E\u0670\u062C\u0650\u0631\u064E\u0670\u062A\u0656 \u0641\u064E\u0671\u0645\u06E1\u062A\u064E\u062D\u0650\u0646\u064F\u0648\u0647\u064F\u0646\u0651\u064E\u06D6 \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0646\u0651\u064E\u06D6 \u0641\u064E\u0625\u0650\u0646\u06E1 \u0639\u064E\u0644\u0650\u0645\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0656 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0631\u06E1\u062C\u0650\u0639\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u0650\u06D6 \u0644\u064E\u0627 \u0647\u064F\u0646\u0651\u064E \u062D\u0650\u0644\u0651\u065E \u0644\u0651\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u0647\u064F\u0645\u06E1 \u064A\u064E\u062D\u0650\u0644\u0651\u064F\u0648\u0646\u064E \u0644\u064E\u0647\u064F\u0646\u0651\u064E\u06D6 \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0647\u064F\u0645 \u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0644\u064E\u0627 \u062C\u064F\u0646\u064E\u0627\u062D\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u062A\u064E\u0646\u0643\u0650\u062D\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0630\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u064A\u06E1\u062A\u064F\u0645\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064F\u0646\u0651\u064E\u06DA \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0645\u06E1\u0633\u0650\u0643\u064F\u0648\u0627\u0652 \u0628\u0650\u0639\u0650\u0635\u064E\u0645\u0650 \u0671\u0644\u06E1\u0643\u064E\u0648\u064E\u0627\u0641\u0650\u0631\u0650 \u0648\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0644\u06E1\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u062D\u064F\u0643\u06E1\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064C \u062D\u064E\u0643\u0650\u064A\u0645\u065E" }, { id: 11, text: "\u0648\u064E\u0625\u0650\u0646 \u0641\u064E\u0627\u062A\u064E\u0643\u064F\u0645\u06E1 \u0634\u064E\u064A\u06E1\u0621\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u0650 \u0641\u064E\u0639\u064E\u0627\u0642\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0640\u0654\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0630\u064E\u0647\u064E\u0628\u064E\u062A\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u062B\u06E1\u0644\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u0641\u064E\u0642\u064F\u0648\u0627\u0652\u06DA \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u064F \u064A\u064F\u0628\u064E\u0627\u064A\u0650\u0639\u06E1\u0646\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u0644\u0651\u064E\u0627 \u064A\u064F\u0634\u06E1\u0631\u0650\u0643\u06E1\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0631\u0650\u0642\u06E1\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0632\u06E1\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0642\u06E1\u062A\u064F\u0644\u06E1\u0646\u064E \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064E\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E \u0628\u0650\u0628\u064F\u0647\u06E1\u062A\u064E\u0670\u0646\u0656 \u064A\u064E\u0641\u06E1\u062A\u064E\u0631\u0650\u064A\u0646\u064E\u0647\u064F\u06E5 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0623\u064E\u0631\u06E1\u062C\u064F\u0644\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0635\u0650\u064A\u0646\u064E\u0643\u064E \u0641\u0650\u064A \u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0656 \u0641\u064E\u0628\u064E\u0627\u064A\u0650\u0639\u06E1\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 13, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u06E1\u0627\u0652 \u0642\u064E\u0648\u06E1\u0645\u064B\u0627 \u063A\u064E\u0636\u0650\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0642\u064E\u062F\u06E1 \u064A\u064E\u0626\u0650\u0633\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0643\u064E\u0645\u064E\u0627 \u064A\u064E\u0626\u0650\u0633\u064E \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064F \u0645\u0650\u0646\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u0642\u064F\u0628\u064F\u0648\u0631\u0650" }] }, { id: 61, name: "\u0627\u0644\u0635\u0641", transliteration: "As-Saf", type: "medinan", total_verses: 14, verses: [{ id: 1, text: "\u0633\u064E\u0628\u0651\u064E\u062D\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 2, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u0645\u064E \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0643\u064E\u0628\u064F\u0631\u064E \u0645\u064E\u0642\u06E1\u062A\u064B\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u0650\u0628\u0651\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6 \u0635\u064E\u0641\u0651\u0657\u0627 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0628\u064F\u0646\u06E1\u064A\u064E\u0670\u0646\u065E \u0645\u0651\u064E\u0631\u06E1\u0635\u064F\u0648\u0635\u065E" }, { id: 5, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0645\u064F\u0648\u0633\u064E\u0649\u0670 \u0644\u0650\u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6 \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0644\u0650\u0645\u064E \u062A\u064F\u0624\u06E1\u0630\u064F\u0648\u0646\u064E\u0646\u0650\u064A \u0648\u064E\u0642\u064E\u062F \u062A\u0651\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0623\u064E\u0646\u0651\u0650\u064A \u0631\u064E\u0633\u064F\u0648\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0632\u064E\u0627\u063A\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0632\u064E\u0627\u063A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0642\u064F\u0644\u064F\u0648\u0628\u064E\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 6, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E \u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u064A\u064E\u0670\u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u0631\u064E\u0633\u064F\u0648\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u0657\u0627 \u0644\u0651\u0650\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E \u064A\u064E\u062F\u064E\u064A\u0651\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u0650 \u0648\u064E\u0645\u064F\u0628\u064E\u0634\u0651\u0650\u0631\u064E\u06E2\u0627 \u0628\u0650\u0631\u064E\u0633\u064F\u0648\u0644\u0656 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650\u064A \u0671\u0633\u06E1\u0645\u064F\u0647\u064F\u06E5\u0653 \u0623\u064E\u062D\u06E1\u0645\u064E\u062F\u064F\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0647\u064E\u0670\u0630\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 7, text: "\u0648\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0638\u06E1\u0644\u064E\u0645\u064F \u0645\u0650\u0645\u0651\u064E\u0646\u0650 \u0671\u0641\u06E1\u062A\u064E\u0631\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0643\u064E\u0630\u0650\u0628\u064E \u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064F\u062F\u06E1\u0639\u064E\u0649\u0670\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0625\u0650\u0633\u06E1\u0644\u064E\u0670\u0645\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u064A\u064F\u0631\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0644\u0650\u064A\u064F\u0637\u06E1\u0641\u0650\u0640\u0654\u064F\u0648\u0627\u0652 \u0646\u064F\u0648\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0623\u064E\u0641\u06E1\u0648\u064E\u0670\u0647\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064F\u062A\u0650\u0645\u0651\u064F \u0646\u064F\u0648\u0631\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0631\u0650\u0647\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670 \u0648\u064E\u062F\u0650\u064A\u0646\u0650 \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0644\u0650\u064A\u064F\u0638\u06E1\u0647\u0650\u0631\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650 \u0643\u064F\u0644\u0651\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u064E\u0648\u06E1 \u0643\u064E\u0631\u0650\u0647\u064E \u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0647\u064E\u0644\u06E1 \u0623\u064E\u062F\u064F\u0644\u0651\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u062A\u0650\u062C\u064E\u0670\u0631\u064E\u0629\u0656 \u062A\u064F\u0646\u062C\u0650\u064A\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 11, text: "\u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u062A\u064F\u062C\u064E\u0670\u0647\u0650\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 12, text: "\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0630\u064F\u0646\u064F\u0648\u0628\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u06E1\u0643\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u0648\u064E\u0645\u064E\u0633\u064E\u0670\u0643\u0650\u0646\u064E \u0637\u064E\u064A\u0651\u0650\u0628\u064E\u0629\u0657 \u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0639\u064E\u062F\u06E1\u0646\u0656\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 13, text: "\u0648\u064E\u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670 \u062A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E\u0647\u064E\u0627\u06D6 \u0646\u064E\u0635\u06E1\u0631\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0641\u064E\u062A\u06E1\u062D\u065E \u0642\u064E\u0631\u0650\u064A\u0628\u065E\u06D7 \u0648\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0643\u064F\u0648\u0646\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0635\u064E\u0627\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0645\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0639\u0650\u064A\u0633\u064E\u0649 \u0671\u0628\u06E1\u0646\u064F \u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0644\u0650\u0644\u06E1\u062D\u064E\u0648\u064E\u0627\u0631\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0645\u064E\u0646\u06E1 \u0623\u064E\u0646\u0635\u064E\u0627\u0631\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u062D\u064E\u0648\u064E\u0627\u0631\u0650\u064A\u0651\u064F\u0648\u0646\u064E \u0646\u064E\u062D\u06E1\u0646\u064F \u0623\u064E\u0646\u0635\u064E\u0627\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0641\u064E\u0640\u0654\u064E\u0627\u0645\u064E\u0646\u064E\u062A \u0637\u0651\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0633\u06E1\u0631\u064E\u0640\u0670\u0653\u0621\u0650\u064A\u0644\u064E \u0648\u064E\u0643\u064E\u0641\u064E\u0631\u064E\u062A \u0637\u0651\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E\u06D6 \u0641\u064E\u0623\u064E\u064A\u0651\u064E\u062F\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0639\u064E\u062F\u064F\u0648\u0651\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064F\u0648\u0627\u0652 \u0638\u064E\u0670\u0647\u0650\u0631\u0650\u064A\u0646\u064E" }] }, { id: 62, name: "\u0627\u0644\u062C\u0645\u0639\u0629", transliteration: "Al-Jumu'ah", type: "medinan", total_verses: 11, verses: [{ id: 1, text: "\u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0671\u0644\u06E1\u0645\u064E\u0644\u0650\u0643\u0650 \u0671\u0644\u06E1\u0642\u064F\u062F\u0651\u064F\u0648\u0633\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u0650" }, { id: 2, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u064E\u0639\u064E\u062B\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064F\u0645\u0651\u0650\u064A\u0651\u0650\u0640\u06E7\u0646\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0632\u064E\u0643\u0651\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u064A\u064F\u0639\u064E\u0644\u0651\u0650\u0645\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u0643\u06E1\u0645\u064E\u0629\u064E \u0648\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0644\u064E\u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 3, text: "\u0648\u064E\u0621\u064E\u0627\u062E\u064E\u0631\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0644\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0644\u06E1\u062D\u064E\u0642\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 4, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0636\u06E1\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064F\u0624\u06E1\u062A\u0650\u064A\u0647\u0650 \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0630\u064F\u0648 \u0671\u0644\u06E1\u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 5, text: "\u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062D\u064F\u0645\u0651\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u062A\u0651\u064E\u0648\u06E1\u0631\u064E\u0649\u0670\u0629\u064E \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F\u0648\u0647\u064E\u0627 \u0643\u064E\u0645\u064E\u062B\u064E\u0644\u0650 \u0671\u0644\u06E1\u062D\u0650\u0645\u064E\u0627\u0631\u0650 \u064A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F \u0623\u064E\u0633\u06E1\u0641\u064E\u0627\u0631\u064E\u06E2\u0627\u06DA \u0628\u0650\u0626\u06E1\u0633\u064E \u0645\u064E\u062B\u064E\u0644\u064F \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 6, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064E\u0627\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646 \u0632\u064E\u0639\u064E\u0645\u06E1\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646\u0651\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u06E1\u0644\u0650\u064A\u064E\u0627\u0653\u0621\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u0641\u064E\u062A\u064E\u0645\u064E\u0646\u0651\u064E\u0648\u064F\u0627\u0652 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062A\u064E\u0645\u064E\u0646\u0651\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0628\u064E\u062F\u064E\u06E2\u0627 \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062A\u064E\u0641\u0650\u0631\u0651\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u064E\u0670\u0642\u0650\u064A\u0643\u064F\u0645\u06E1\u06D6 \u062B\u064F\u0645\u0651\u064E \u062A\u064F\u0631\u064E\u062F\u0651\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0639\u064E\u0670\u0644\u0650\u0645\u0650 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650 \u0641\u064E\u064A\u064F\u0646\u064E\u0628\u0651\u0650\u0626\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064E\u0627 \u0646\u064F\u0648\u062F\u0650\u064A\u064E \u0644\u0650\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u0650 \u0645\u0650\u0646 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u062C\u064F\u0645\u064F\u0639\u064E\u0629\u0650 \u0641\u064E\u0671\u0633\u06E1\u0639\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0630\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u0639\u064E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064F\u0636\u0650\u064A\u064E\u062A\u0650 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064F \u0641\u064E\u0671\u0646\u062A\u064E\u0634\u0650\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0671\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627 \u0644\u0651\u064E\u0639\u064E\u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062A\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0627\u0652 \u062A\u0650\u062C\u064E\u0670\u0631\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u0644\u064E\u0647\u06E1\u0648\u064B\u0627 \u0671\u0646\u0641\u064E\u0636\u0651\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0648\u064E\u062A\u064E\u0631\u064E\u0643\u064F\u0648\u0643\u064E \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u0657\u0627\u06DA \u0642\u064F\u0644\u06E1 \u0645\u064E\u0627 \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u06E1\u0648\u0650 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u062A\u0651\u0650\u062C\u064E\u0670\u0631\u064E\u0629\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u0631\u0651\u064E\u0640\u0670\u0632\u0650\u0642\u0650\u064A\u0646\u064E" }] }, { id: 63, name: "\u0627\u0644\u0645\u0646\u0627\u0641\u0642\u0648\u0646", transliteration: "Al-Munafiqun", type: "medinan", total_verses: 11, verses: [{ id: 1, text: "\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u064F\u0648\u0646\u064E \u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0646\u064E\u0634\u06E1\u0647\u064E\u062F\u064F \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0644\u064E\u0643\u064E\u0670\u0630\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 2, text: "\u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064E\u0647\u064F\u0645\u06E1 \u062C\u064F\u0646\u0651\u064E\u0629\u0657 \u0641\u064E\u0635\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u0627\u0653\u0621\u064E \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u062B\u064F\u0645\u0651\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0637\u064F\u0628\u0650\u0639\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u06DE\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u062A\u064F\u0639\u06E1\u062C\u0650\u0628\u064F\u0643\u064E \u0623\u064E\u062C\u06E1\u0633\u064E\u0627\u0645\u064F\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0627\u0652 \u062A\u064E\u0633\u06E1\u0645\u064E\u0639\u06E1 \u0644\u0650\u0642\u064E\u0648\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1\u06D6 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u062E\u064F\u0634\u064F\u0628\u065E \u0645\u0651\u064F\u0633\u064E\u0646\u0651\u064E\u062F\u064E\u0629\u065E\u06D6 \u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F\u0648\u0646\u064E \u0643\u064F\u0644\u0651\u064E \u0635\u064E\u064A\u06E1\u062D\u064E\u0629\u064D \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u062F\u064F\u0648\u0651\u064F \u0641\u064E\u0671\u062D\u06E1\u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1\u06DA \u0642\u064E\u0670\u062A\u064E\u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06D6 \u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u064A\u064F\u0624\u06E1\u0641\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062A\u064E\u0639\u064E\u0627\u0644\u064E\u0648\u06E1\u0627\u0652 \u064A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0648\u0651\u064E\u0648\u06E1\u0627\u0652 \u0631\u064F\u0621\u064F\u0648\u0633\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0635\u064F\u062F\u0651\u064F\u0648\u0646\u064E \u0648\u064E\u0647\u064F\u0645 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0633\u064E\u0648\u064E\u0627\u0653\u0621\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0623\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u064E\u0631\u06E1\u062A\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1 \u0644\u064E\u0645\u06E1 \u062A\u064E\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0646 \u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0644\u064E\u0627 \u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0641\u064E\u0670\u0633\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u064E\u0627 \u062A\u064F\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0646\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0646\u0641\u064E\u0636\u0651\u064F\u0648\u0627\u0652\u06D7 \u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u062E\u064E\u0632\u064E\u0627\u0653\u0626\u0650\u0646\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0641\u06E1\u0642\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0644\u064E\u0626\u0650\u0646 \u0631\u0651\u064E\u062C\u064E\u0639\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0645\u064E\u062F\u0650\u064A\u0646\u064E\u0629\u0650 \u0644\u064E\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u064E\u0632\u0651\u064F \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0630\u064E\u0644\u0651\u064E\u06DA \u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0639\u0650\u0632\u0651\u064E\u0629\u064F \u0648\u064E\u0644\u0650\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 9, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064F\u0644\u06E1\u0647\u0650\u0643\u064F\u0645\u06E1 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064F\u0643\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u06E1 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0670\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0623\u064E\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0645\u0651\u064E\u0627 \u0631\u064E\u0632\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E \u0623\u064E\u062D\u064E\u062F\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064F \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u062E\u0651\u064E\u0631\u06E1\u062A\u064E\u0646\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0642\u064E\u0631\u0650\u064A\u0628\u0656 \u0641\u064E\u0623\u064E\u0635\u0651\u064E\u062F\u0651\u064E\u0642\u064E \u0648\u064E\u0623\u064E\u0643\u064F\u0646 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0644\u064E\u0646 \u064A\u064F\u0624\u064E\u062E\u0651\u0650\u0631\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0646\u064E\u0641\u06E1\u0633\u064B\u0627 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u062C\u064E\u0644\u064F\u0647\u064E\u0627\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2 \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }] }, { id: 64, name: "\u0627\u0644\u062A\u063A\u0627\u0628\u0646", transliteration: "At-Taghabun", type: "medinan", total_verses: 18, verses: [{ id: 1, text: "\u064A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06D6 \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064F \u0648\u064E\u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u062D\u064E\u0645\u06E1\u062F\u064F\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 2, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0643\u064E\u0627\u0641\u0650\u0631\u065E \u0648\u064E\u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u065E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u064E\u0635\u0650\u064A\u0631\u064C" }, { id: 3, text: "\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u0635\u064E\u0648\u0651\u064E\u0631\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0635\u064F\u0648\u064E\u0631\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 4, text: "\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0627 \u062A\u064F\u0633\u0650\u0631\u0651\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0639\u06E1\u0644\u0650\u0646\u064F\u0648\u0646\u064E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 5, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u0643\u064F\u0645\u06E1 \u0646\u064E\u0628\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u064F \u0641\u064E\u0630\u064E\u0627\u0642\u064F\u0648\u0627\u0652 \u0648\u064E\u0628\u064E\u0627\u0644\u064E \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 6, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E\u062A \u062A\u0651\u064E\u0623\u06E1\u062A\u0650\u064A\u0647\u0650\u0645\u06E1 \u0631\u064F\u0633\u064F\u0644\u064F\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0650 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0628\u064E\u0634\u064E\u0631\u065E \u064A\u064E\u0647\u06E1\u062F\u064F\u0648\u0646\u064E\u0646\u064E\u0627 \u0641\u064E\u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0648\u0627\u0652\u06D6 \u0648\u0651\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0646\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0646\u0650\u064A\u0651\u064C \u062D\u064E\u0645\u0650\u064A\u062F\u065E" }, { id: 7, text: "\u0632\u064E\u0639\u064E\u0645\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u064A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0648\u0627\u0652\u06DA \u0642\u064F\u0644\u06E1 \u0628\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u0631\u064E\u0628\u0651\u0650\u064A \u0644\u064E\u062A\u064F\u0628\u06E1\u0639\u064E\u062B\u064F\u0646\u0651\u064E \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u062A\u064F\u0646\u064E\u0628\u0651\u064E\u0624\u064F\u0646\u0651\u064E \u0628\u0650\u0645\u064E\u0627 \u0639\u064E\u0645\u0650\u0644\u06E1\u062A\u064F\u0645\u06E1\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0633\u0650\u064A\u0631\u065E" }, { id: 8, text: "\u0641\u064E\u0640\u0654\u064E\u0627\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0671\u0644\u0646\u0651\u064F\u0648\u0631\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E \u062E\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 9, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u062C\u06E1\u0645\u064E\u0639\u064F\u0643\u064F\u0645\u06E1 \u0644\u0650\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u062C\u064E\u0645\u06E1\u0639\u0650\u06D6 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u062A\u0651\u064E\u063A\u064E\u0627\u0628\u064F\u0646\u0650\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u06E2 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u064A\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u06E1\u0647\u064F \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u064F" }, { id: 10, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627\u0653 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 11, text: "\u0645\u064E\u0627\u0653 \u0623\u064E\u0635\u064E\u0627\u0628\u064E \u0645\u0650\u0646 \u0645\u0651\u064F\u0635\u0650\u064A\u0628\u064E\u0629\u064D \u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u06E2 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u0647\u06E1\u062F\u0650 \u0642\u064E\u0644\u06E1\u0628\u064E\u0647\u064F\u06E5\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 12, text: "\u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E\u06DA \u0641\u064E\u0625\u0650\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u0633\u064F\u0648\u0644\u0650\u0646\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u0670\u063A\u064F \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u064F" }, { id: 13, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06DA \u0648\u064E\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u0650 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 14, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0645\u0650\u0646\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u0650\u0643\u064F\u0645\u06E1 \u0639\u064E\u062F\u064F\u0648\u0651\u0657\u0627 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0671\u062D\u06E1\u0630\u064E\u0631\u064F\u0648\u0647\u064F\u0645\u06E1\u06DA \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0639\u06E1\u0641\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u0635\u06E1\u0641\u064E\u062D\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064C" }, { id: 15, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0648\u06E1\u0644\u064E\u0670\u062F\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u065E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062C\u06E1\u0631\u064C \u0639\u064E\u0638\u0650\u064A\u0645\u065E" }, { id: 16, text: "\u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627 \u0671\u0633\u06E1\u062A\u064E\u0637\u064E\u0639\u06E1\u062A\u064F\u0645\u06E1 \u0648\u064E\u0671\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0627\u0652 \u0648\u064E\u0623\u064E\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0644\u0651\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645\u06E1\u06D7 \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0648\u0642\u064E \u0634\u064F\u062D\u0651\u064E \u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064F\u0641\u06E1\u0644\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 17, text: "\u0625\u0650\u0646 \u062A\u064F\u0642\u06E1\u0631\u0650\u0636\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u0631\u06E1\u0636\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627 \u064A\u064F\u0636\u064E\u0670\u0639\u0650\u0641\u06E1\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0634\u064E\u0643\u064F\u0648\u0631\u064C \u062D\u064E\u0644\u0650\u064A\u0645\u064C" }, { id: 18, text: "\u0639\u064E\u0670\u0644\u0650\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }] }, { id: 65, name: "\u0627\u0644\u0637\u0644\u0627\u0642", transliteration: "At-Talaq", type: "medinan", total_verses: 12, verses: [{ id: 1, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0625\u0650\u0630\u064E\u0627 \u0637\u064E\u0644\u0651\u064E\u0642\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0637\u064E\u0644\u0651\u0650\u0642\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0644\u0650\u0639\u0650\u062F\u0651\u064E\u062A\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0623\u064E\u062D\u06E1\u0635\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0639\u0650\u062F\u0651\u064E\u0629\u064E\u06D6 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1\u06D6 \u0644\u064E\u0627 \u062A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0645\u0650\u0646\u06E2 \u0628\u064F\u064A\u064F\u0648\u062A\u0650\u0647\u0650\u0646\u0651\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u06E1\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0646\u064E \u0628\u0650\u0641\u064E\u0670\u062D\u0650\u0634\u064E\u0629\u0656 \u0645\u0651\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u0656\u06DA \u0648\u064E\u062A\u0650\u0644\u06E1\u0643\u064E \u062D\u064F\u062F\u064F\u0648\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0639\u064E\u062F\u0651\u064E \u062D\u064F\u062F\u064F\u0648\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0638\u064E\u0644\u064E\u0645\u064E \u0646\u064E\u0641\u06E1\u0633\u064E\u0647\u064F\u06E5\u06DA \u0644\u064E\u0627 \u062A\u064E\u062F\u06E1\u0631\u0650\u064A \u0644\u064E\u0639\u064E\u0644\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u062D\u06E1\u062F\u0650\u062B\u064F \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0645\u06E1\u0631\u0657\u0627" }, { id: 2, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u06E1\u0646\u064E \u0623\u064E\u062C\u064E\u0644\u064E\u0647\u064F\u0646\u0651\u064E \u0641\u064E\u0623\u064E\u0645\u06E1\u0633\u0650\u0643\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0628\u0650\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u064D \u0623\u064E\u0648\u06E1 \u0641\u064E\u0627\u0631\u0650\u0642\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0628\u0650\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0656 \u0648\u064E\u0623\u064E\u0634\u06E1\u0647\u0650\u062F\u064F\u0648\u0627\u0652 \u0630\u064E\u0648\u064E\u064A\u06E1 \u0639\u064E\u062F\u06E1\u0644\u0656 \u0645\u0651\u0650\u0646\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0634\u0651\u064E\u0647\u064E\u0670\u062F\u064E\u0629\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064F\u0645\u06E1 \u064A\u064F\u0648\u0639\u064E\u0638\u064F \u0628\u0650\u0647\u0650\u06E6 \u0645\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u064E\u062E\u06E1\u0631\u064E\u062C\u0657\u0627" }, { id: 3, text: "\u0648\u064E\u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u06E1\u0647\u064F \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u062A\u064E\u0633\u0650\u0628\u064F\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0647\u064F\u0648\u064E \u062D\u064E\u0633\u06E1\u0628\u064F\u0647\u064F\u06E5\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0628\u064E\u0670\u0644\u0650\u063A\u064F \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6\u06DA \u0642\u064E\u062F\u06E1 \u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u06E1\u0631\u0657\u0627" }, { id: 4, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0640\u0670\u0653\u0640\u0654\u0650\u064A \u064A\u064E\u0626\u0650\u0633\u06E1\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u062D\u0650\u064A\u0636\u0650 \u0645\u0650\u0646 \u0646\u0651\u0650\u0633\u064E\u0627\u0653\u0626\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0650 \u0671\u0631\u06E1\u062A\u064E\u0628\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0639\u0650\u062F\u0651\u064E\u062A\u064F\u0647\u064F\u0646\u0651\u064E \u062B\u064E\u0644\u064E\u0670\u062B\u064E\u0629\u064F \u0623\u064E\u0634\u06E1\u0647\u064F\u0631\u0656 \u0648\u064E\u0671\u0644\u0651\u064E\u0640\u0670\u0653\u0640\u0654\u0650\u064A \u0644\u064E\u0645\u06E1 \u064A\u064E\u062D\u0650\u0636\u06E1\u0646\u064E\u06DA \u0648\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0670\u062A\u064F \u0671\u0644\u06E1\u0623\u064E\u062D\u06E1\u0645\u064E\u0627\u0644\u0650 \u0623\u064E\u062C\u064E\u0644\u064F\u0647\u064F\u0646\u0651\u064E \u0623\u064E\u0646 \u064A\u064E\u0636\u064E\u0639\u06E1\u0646\u064E \u062D\u064E\u0645\u06E1\u0644\u064E\u0647\u064F\u0646\u0651\u064E\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u0650\u06E6 \u064A\u064F\u0633\u06E1\u0631\u0657\u0627" }, { id: 5, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0623\u064E\u0645\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646\u0632\u064E\u0644\u064E\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u062A\u0651\u064E\u0642\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064F \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u064A\u064F\u0639\u06E1\u0638\u0650\u0645\u06E1 \u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062C\u06E1\u0631\u064B\u0627" }, { id: 6, text: "\u0623\u064E\u0633\u06E1\u0643\u0650\u0646\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0645\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0633\u064E\u0643\u064E\u0646\u062A\u064F\u0645 \u0645\u0651\u0650\u0646 \u0648\u064F\u062C\u06E1\u062F\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0636\u064E\u0627\u0653\u0631\u0651\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0644\u0650\u062A\u064F\u0636\u064E\u064A\u0651\u0650\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E\u06DA \u0648\u064E\u0625\u0650\u0646 \u0643\u064F\u0646\u0651\u064E \u0623\u064F\u0648\u0652\u0644\u064E\u0670\u062A\u0650 \u062D\u064E\u0645\u06E1\u0644\u0656 \u0641\u064E\u0623\u064E\u0646\u0641\u0650\u0642\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0646\u0651\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064E\u0636\u064E\u0639\u06E1\u0646\u064E \u062D\u064E\u0645\u06E1\u0644\u064E\u0647\u064F\u0646\u0651\u064E\u06DA \u0641\u064E\u0625\u0650\u0646\u06E1 \u0623\u064E\u0631\u06E1\u0636\u064E\u0639\u06E1\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u064E\u0640\u0654\u064E\u0627\u062A\u064F\u0648\u0647\u064F\u0646\u0651\u064E \u0623\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064F\u0646\u0651\u064E \u0648\u064E\u0623\u06E1\u062A\u064E\u0645\u0650\u0631\u064F\u0648\u0627\u0652 \u0628\u064E\u064A\u06E1\u0646\u064E\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0639\u06E1\u0631\u064F\u0648\u0641\u0656\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0639\u064E\u0627\u0633\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u0641\u064E\u0633\u064E\u062A\u064F\u0631\u06E1\u0636\u0650\u0639\u064F \u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064F\u062E\u06E1\u0631\u064E\u0649\u0670" }, { id: 7, text: "\u0644\u0650\u064A\u064F\u0646\u0641\u0650\u0642\u06E1 \u0630\u064F\u0648 \u0633\u064E\u0639\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0633\u064E\u0639\u064E\u062A\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0645\u064E\u0646 \u0642\u064F\u062F\u0650\u0631\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0631\u0650\u0632\u06E1\u0642\u064F\u0647\u064F\u06E5 \u0641\u064E\u0644\u06E1\u064A\u064F\u0646\u0641\u0650\u0642\u06E1 \u0645\u0650\u0645\u0651\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0644\u064E\u0627 \u064A\u064F\u0643\u064E\u0644\u0651\u0650\u0641\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0646\u064E\u0641\u06E1\u0633\u064B\u0627 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627\u0653 \u0621\u064E\u0627\u062A\u064E\u0649\u0670\u0647\u064E\u0627\u06DA \u0633\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u064E\u0639\u06E1\u062F\u064E \u0639\u064F\u0633\u06E1\u0631\u0656 \u064A\u064F\u0633\u06E1\u0631\u0657\u0627" }, { id: 8, text: "\u0648\u064E\u0643\u064E\u0623\u064E\u064A\u0651\u0650\u0646 \u0645\u0651\u0650\u0646 \u0642\u064E\u0631\u06E1\u064A\u064E\u0629\u064D \u0639\u064E\u062A\u064E\u062A\u06E1 \u0639\u064E\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u064E\u0627 \u0648\u064E\u0631\u064F\u0633\u064F\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u062D\u064E\u0627\u0633\u064E\u0628\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u062D\u0650\u0633\u064E\u0627\u0628\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u0657\u0627 \u0648\u064E\u0639\u064E\u0630\u0651\u064E\u0628\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0646\u0651\u064F\u0643\u06E1\u0631\u0657\u0627" }, { id: 9, text: "\u0641\u064E\u0630\u064E\u0627\u0642\u064E\u062A\u06E1 \u0648\u064E\u0628\u064E\u0627\u0644\u064E \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u064E\u0627 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0670\u0642\u0650\u0628\u064E\u0629\u064F \u0623\u064E\u0645\u06E1\u0631\u0650\u0647\u064E\u0627 \u062E\u064F\u0633\u06E1\u0631\u064B\u0627" }, { id: 10, text: "\u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u0657\u0627\u06D6 \u0641\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0640\u0670\u0653\u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0644\u06E1\u0628\u064E\u0670\u0628\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652\u06DA \u0642\u064E\u062F\u06E1 \u0623\u064E\u0646\u0632\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0630\u0650\u0643\u06E1\u0631\u0657\u0627" }, { id: 11, text: "\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0645\u064F\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0670\u062A\u0656 \u0644\u0651\u0650\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u0638\u0651\u064F\u0644\u064F\u0645\u064E\u0670\u062A\u0650 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064F\u0648\u0631\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u06E2 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0635\u064E\u0670\u0644\u0650\u062D\u0657\u0627 \u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u06E1\u0647\u064F \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06D6 \u0642\u064E\u062F\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0647\u064F\u06E5 \u0631\u0650\u0632\u06E1\u0642\u064B\u0627" }, { id: 12, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0633\u064E\u0628\u06E1\u0639\u064E \u0633\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0656 \u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u0650\u062B\u06E1\u0644\u064E\u0647\u064F\u0646\u0651\u064E\u06D6 \u064A\u064E\u062A\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u064F \u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0646\u0651\u064E \u0644\u0650\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E \u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u062F\u06E1 \u0623\u064E\u062D\u064E\u0627\u0637\u064E \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u0650\u0644\u06E1\u0645\u064E\u06E2\u0627" }] }, { id: 66, name: "\u0627\u0644\u062A\u062D\u0631\u064A\u0645", transliteration: "At-Tahrim", type: "medinan", total_verses: 12, verses: [{ id: 1, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0644\u0650\u0645\u064E \u062A\u064F\u062D\u064E\u0631\u0651\u0650\u0645\u064F \u0645\u064E\u0627\u0653 \u0623\u064E\u062D\u064E\u0644\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064E\u06D6 \u062A\u064E\u0628\u06E1\u062A\u064E\u063A\u0650\u064A \u0645\u064E\u0631\u06E1\u0636\u064E\u0627\u062A\u064E \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0643\u064E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u065E" }, { id: 2, text: "\u0642\u064E\u062F\u06E1 \u0641\u064E\u0631\u064E\u0636\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u062D\u0650\u0644\u0651\u064E\u0629\u064E \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0643\u064F\u0645\u06E1\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0643\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0643\u0650\u064A\u0645\u064F" }, { id: 3, text: "\u0648\u064E\u0625\u0650\u0630\u06E1 \u0623\u064E\u0633\u064E\u0631\u0651\u064E \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0650 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0647\u0650\u06E6 \u062D\u064E\u062F\u0650\u064A\u062B\u0657\u0627 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0646\u064E\u0628\u0651\u064E\u0623\u064E\u062A\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u0638\u06E1\u0647\u064E\u0631\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0639\u064E\u0631\u0651\u064E\u0641\u064E \u0628\u064E\u0639\u06E1\u0636\u064E\u0647\u064F\u06E5 \u0648\u064E\u0623\u064E\u0639\u06E1\u0631\u064E\u0636\u064E \u0639\u064E\u0646\u06E2 \u0628\u064E\u0639\u06E1\u0636\u0656\u06D6 \u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0646\u064E\u0628\u0651\u064E\u0623\u064E\u0647\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0646\u06E2\u0628\u064E\u0623\u064E\u0643\u064E \u0647\u064E\u0670\u0630\u064E\u0627\u06D6 \u0642\u064E\u0627\u0644\u064E \u0646\u064E\u0628\u0651\u064E\u0623\u064E\u0646\u0650\u064A\u064E \u0671\u0644\u06E1\u0639\u064E\u0644\u0650\u064A\u0645\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 4, text: "\u0625\u0650\u0646 \u062A\u064E\u062A\u064F\u0648\u0628\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0642\u064E\u062F\u06E1 \u0635\u064E\u063A\u064E\u062A\u06E1 \u0642\u064F\u0644\u064F\u0648\u0628\u064F\u0643\u064F\u0645\u064E\u0627\u06D6 \u0648\u064E\u0625\u0650\u0646 \u062A\u064E\u0638\u064E\u0670\u0647\u064E\u0631\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0647\u064F\u0648\u064E \u0645\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0647\u064F \u0648\u064E\u062C\u0650\u0628\u06E1\u0631\u0650\u064A\u0644\u064F \u0648\u064E\u0635\u064E\u0670\u0644\u0650\u062D\u064F \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E\u06D6 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0638\u064E\u0647\u0650\u064A\u0631\u064C" }, { id: 5, text: "\u0639\u064E\u0633\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0646 \u0637\u064E\u0644\u0651\u064E\u0642\u064E\u0643\u064F\u0646\u0651\u064E \u0623\u064E\u0646 \u064A\u064F\u0628\u06E1\u062F\u0650\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u064B\u0627 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u0643\u064F\u0646\u0651\u064E \u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064E\u0670\u062A\u0656 \u0645\u0651\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0656 \u0642\u064E\u0670\u0646\u0650\u062A\u064E\u0670\u062A\u0656 \u062A\u064E\u0640\u0670\u0653\u0626\u0650\u0628\u064E\u0670\u062A\u064D \u0639\u064E\u0670\u0628\u0650\u062F\u064E\u0670\u062A\u0656 \u0633\u064E\u0640\u0670\u0653\u0626\u0650\u062D\u064E\u0670\u062A\u0656 \u062B\u064E\u064A\u0651\u0650\u0628\u064E\u0670\u062A\u0656 \u0648\u064E\u0623\u064E\u0628\u06E1\u0643\u064E\u0627\u0631\u0657\u0627" }, { id: 6, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0642\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0646\u0641\u064F\u0633\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u0650\u064A\u0643\u064F\u0645\u06E1 \u0646\u064E\u0627\u0631\u0657\u0627 \u0648\u064E\u0642\u064F\u0648\u062F\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0648\u064E\u0671\u0644\u06E1\u062D\u0650\u062C\u064E\u0627\u0631\u064E\u0629\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064C \u063A\u0650\u0644\u064E\u0627\u0638\u065E \u0634\u0650\u062F\u064E\u0627\u062F\u065E \u0644\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0635\u064F\u0648\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u064E\u0631\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0639\u06E1\u062A\u064E\u0630\u0650\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062A\u064F\u062C\u06E1\u0632\u064E\u0648\u06E1\u0646\u064E \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 8, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u062A\u064F\u0648\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u062A\u064E\u0648\u06E1\u0628\u064E\u0629\u0657 \u0646\u0651\u064E\u0635\u064F\u0648\u062D\u064B\u0627 \u0639\u064E\u0633\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064F\u0643\u064E\u0641\u0651\u0650\u0631\u064E \u0639\u064E\u0646\u0643\u064F\u0645\u06E1 \u0633\u064E\u064A\u0651\u0650\u0640\u0654\u064E\u0627\u062A\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064E\u0643\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u064A\u064F\u062E\u06E1\u0632\u0650\u064A \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064E \u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E\u0647\u064F\u06E5\u06D6 \u0646\u064F\u0648\u0631\u064F\u0647\u064F\u0645\u06E1 \u064A\u064E\u0633\u06E1\u0639\u064E\u0649\u0670 \u0628\u064E\u064A\u06E1\u0646\u064E \u0623\u064E\u064A\u06E1\u062F\u0650\u064A\u0647\u0650\u0645\u06E1 \u0648\u064E\u0628\u0650\u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0646\u064E\u0627\u0653 \u0623\u064E\u062A\u06E1\u0645\u0650\u0645\u06E1 \u0644\u064E\u0646\u064E\u0627 \u0646\u064F\u0648\u0631\u064E\u0646\u064E\u0627 \u0648\u064E\u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0646\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u065E" }, { id: 9, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0628\u0650\u064A\u0651\u064F \u062C\u064E\u0670\u0647\u0650\u062F\u0650 \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0646\u064E\u0670\u0641\u0650\u0642\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u063A\u06E1\u0644\u064F\u0638\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1\u06DA \u0648\u064E\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064F\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 10, text: "\u0636\u064E\u0631\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E \u0646\u064F\u0648\u062D\u0656 \u0648\u064E\u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E \u0644\u064F\u0648\u0637\u0656\u06D6 \u0643\u064E\u0627\u0646\u064E\u062A\u064E\u0627 \u062A\u064E\u062D\u06E1\u062A\u064E \u0639\u064E\u0628\u06E1\u062F\u064E\u064A\u06E1\u0646\u0650 \u0645\u0650\u0646\u06E1 \u0639\u0650\u0628\u064E\u0627\u062F\u0650\u0646\u064E\u0627 \u0635\u064E\u0670\u0644\u0650\u062D\u064E\u064A\u06E1\u0646\u0650 \u0641\u064E\u062E\u064E\u0627\u0646\u064E\u062A\u064E\u0627\u0647\u064F\u0645\u064E\u0627 \u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A\u064E\u0627 \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0671\u062F\u06E1\u062E\u064F\u0644\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u062F\u0651\u064E\u0640\u0670\u062E\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u0648\u064E\u0636\u064E\u0631\u064E\u0628\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u062B\u064E\u0644\u0657\u0627 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0630\u06E1 \u0642\u064E\u0627\u0644\u064E\u062A\u06E1 \u0631\u064E\u0628\u0651\u0650 \u0671\u0628\u06E1\u0646\u0650 \u0644\u0650\u064A \u0639\u0650\u0646\u062F\u064E\u0643\u064E \u0628\u064E\u064A\u06E1\u062A\u0657\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0648\u064E\u0646\u064E\u062C\u0651\u0650\u0646\u0650\u064A \u0645\u0650\u0646 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u0639\u064E\u0645\u064E\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0646\u064E\u062C\u0651\u0650\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 12, text: "\u0648\u064E\u0645\u064E\u0631\u06E1\u064A\u064E\u0645\u064E \u0671\u0628\u06E1\u0646\u064E\u062A\u064E \u0639\u0650\u0645\u06E1\u0631\u064E\u0670\u0646\u064E \u0671\u0644\u0651\u064E\u062A\u0650\u064A\u0653 \u0623\u064E\u062D\u06E1\u0635\u064E\u0646\u064E\u062A\u06E1 \u0641\u064E\u0631\u06E1\u062C\u064E\u0647\u064E\u0627 \u0641\u064E\u0646\u064E\u0641\u064E\u062E\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u0650 \u0645\u0650\u0646 \u0631\u0651\u064F\u0648\u062D\u0650\u0646\u064E\u0627 \u0648\u064E\u0635\u064E\u062F\u0651\u064E\u0642\u064E\u062A\u06E1 \u0628\u0650\u0643\u064E\u0644\u0650\u0645\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u064E\u0627 \u0648\u064E\u0643\u064F\u062A\u064F\u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064E\u0670\u0646\u0650\u062A\u0650\u064A\u0646\u064E" }] }, { id: 67, name: "\u0627\u0644\u0645\u0644\u0643", transliteration: "Al-Mulk", type: "meccan", total_verses: 30, verses: [{ id: 1, text: "\u062A\u064E\u0628\u064E\u0670\u0631\u064E\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0628\u0650\u064A\u064E\u062F\u0650\u0647\u0650 \u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0643\u064F \u0648\u064E\u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0642\u064E\u062F\u0650\u064A\u0631\u064C" }, { id: 2, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E \u0648\u064E\u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0644\u0650\u064A\u064E\u0628\u06E1\u0644\u064F\u0648\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u0651\u064F\u0643\u064F\u0645\u06E1 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u064F \u0639\u064E\u0645\u064E\u0644\u0657\u0627\u06DA \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u064F \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F" }, { id: 3, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0633\u064E\u0628\u06E1\u0639\u064E \u0633\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0656 \u0637\u0650\u0628\u064E\u0627\u0642\u0657\u0627\u06D6 \u0645\u0651\u064E\u0627 \u062A\u064E\u0631\u064E\u0649\u0670 \u0641\u0650\u064A \u062E\u064E\u0644\u06E1\u0642\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650 \u0645\u0650\u0646 \u062A\u064E\u0641\u064E\u0670\u0648\u064F\u062A\u0656\u06D6 \u0641\u064E\u0671\u0631\u06E1\u062C\u0650\u0639\u0650 \u0671\u0644\u06E1\u0628\u064E\u0635\u064E\u0631\u064E \u0647\u064E\u0644\u06E1 \u062A\u064E\u0631\u064E\u0649\u0670 \u0645\u0650\u0646 \u0641\u064F\u0637\u064F\u0648\u0631\u0656" }, { id: 4, text: "\u062B\u064F\u0645\u0651\u064E \u0671\u0631\u06E1\u062C\u0650\u0639\u0650 \u0671\u0644\u06E1\u0628\u064E\u0635\u064E\u0631\u064E \u0643\u064E\u0631\u0651\u064E\u062A\u064E\u064A\u06E1\u0646\u0650 \u064A\u064E\u0646\u0642\u064E\u0644\u0650\u0628\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0628\u064E\u0635\u064E\u0631\u064F \u062E\u064E\u0627\u0633\u0650\u0626\u0657\u0627 \u0648\u064E\u0647\u064F\u0648\u064E \u062D\u064E\u0633\u0650\u064A\u0631\u065E" }, { id: 5, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0632\u064E\u064A\u0651\u064E\u0646\u0651\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627 \u0628\u0650\u0645\u064E\u0635\u064E\u0670\u0628\u0650\u064A\u062D\u064E \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0631\u064F\u062C\u064F\u0648\u0645\u0657\u0627 \u0644\u0651\u0650\u0644\u0634\u0651\u064E\u064A\u064E\u0670\u0637\u0650\u064A\u0646\u0650\u06D6 \u0648\u064E\u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u0633\u0651\u064E\u0639\u0650\u064A\u0631\u0650" }, { id: 6, text: "\u0648\u064E\u0644\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064F \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E\u06D6 \u0648\u064E\u0628\u0650\u0626\u06E1\u0633\u064E \u0671\u0644\u06E1\u0645\u064E\u0635\u0650\u064A\u0631\u064F" }, { id: 7, text: "\u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064F\u0644\u06E1\u0642\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064E\u0627 \u0634\u064E\u0647\u0650\u064A\u0642\u0657\u0627 \u0648\u064E\u0647\u0650\u064A\u064E \u062A\u064E\u0641\u064F\u0648\u0631\u064F" }, { id: 8, text: "\u062A\u064E\u0643\u064E\u0627\u062F\u064F \u062A\u064E\u0645\u064E\u064A\u0651\u064E\u0632\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0638\u0650\u06D6 \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0644\u06E1\u0642\u0650\u064A\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0641\u064E\u0648\u06E1\u062C\u065E \u0633\u064E\u0623\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u062E\u064E\u0632\u064E\u0646\u064E\u062A\u064F\u0647\u064E\u0627\u0653 \u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0623\u06E1\u062A\u0650\u0643\u064F\u0645\u06E1 \u0646\u064E\u0630\u0650\u064A\u0631\u065E" }, { id: 9, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0628\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u062F\u06E1 \u062C\u064E\u0627\u0653\u0621\u064E\u0646\u064E\u0627 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u06E1\u0646\u064E\u0627 \u0648\u064E\u0642\u064F\u0644\u06E1\u0646\u064E\u0627 \u0645\u064E\u0627 \u0646\u064E\u0632\u0651\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0634\u064E\u064A\u06E1\u0621\u064D \u0625\u0650\u0646\u06E1 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0643\u064E\u0628\u0650\u064A\u0631\u0656" }, { id: 10, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u0623\u064E\u0648\u06E1 \u0646\u064E\u0639\u06E1\u0642\u0650\u0644\u064F \u0645\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0641\u0650\u064A\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u0633\u0651\u064E\u0639\u0650\u064A\u0631\u0650" }, { id: 11, text: "\u0641\u064E\u0671\u0639\u06E1\u062A\u064E\u0631\u064E\u0641\u064F\u0648\u0627\u0652 \u0628\u0650\u0630\u064E\u0646\u06E2\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0633\u064F\u062D\u06E1\u0642\u0657\u0627 \u0644\u0651\u0650\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u0633\u0651\u064E\u0639\u0650\u064A\u0631\u0650" }, { id: 12, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064E\u062E\u06E1\u0634\u064E\u0648\u06E1\u0646\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u065E \u0648\u064E\u0623\u064E\u062C\u06E1\u0631\u065E \u0643\u064E\u0628\u0650\u064A\u0631\u065E" }, { id: 13, text: "\u0648\u064E\u0623\u064E\u0633\u0650\u0631\u0651\u064F\u0648\u0627\u0652 \u0642\u064E\u0648\u06E1\u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0648\u0650 \u0671\u062C\u06E1\u0647\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u06E6\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u0650\u064A\u0645\u064F\u06E2 \u0628\u0650\u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 14, text: "\u0623\u064E\u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0645\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E \u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0637\u0650\u064A\u0641\u064F \u0671\u0644\u06E1\u062E\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 15, text: "\u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0630\u064E\u0644\u064F\u0648\u0644\u0657\u0627 \u0641\u064E\u0671\u0645\u06E1\u0634\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0645\u064E\u0646\u064E\u0627\u0643\u0650\u0628\u0650\u0647\u064E\u0627 \u0648\u064E\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0645\u0650\u0646 \u0631\u0651\u0650\u0632\u06E1\u0642\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0671\u0644\u0646\u0651\u064F\u0634\u064F\u0648\u0631\u064F" }, { id: 16, text: "\u0621\u064E\u0623\u064E\u0645\u0650\u0646\u062A\u064F\u0645 \u0645\u0651\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u0646 \u064A\u064E\u062E\u06E1\u0633\u0650\u0641\u064E \u0628\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u0650\u064A\u064E \u062A\u064E\u0645\u064F\u0648\u0631\u064F" }, { id: 17, text: "\u0623\u064E\u0645\u06E1 \u0623\u064E\u0645\u0650\u0646\u062A\u064F\u0645 \u0645\u0651\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0623\u064E\u0646 \u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u062D\u064E\u0627\u0635\u0650\u0628\u0657\u0627\u06D6 \u0641\u064E\u0633\u064E\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0643\u064E\u064A\u06E1\u0641\u064E \u0646\u064E\u0630\u0650\u064A\u0631\u0650" }, { id: 18, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u0643\u064E\u0627\u0646\u064E \u0646\u064E\u0643\u0650\u064A\u0631\u0650" }, { id: 19, text: "\u0623\u064E\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0637\u0651\u064E\u064A\u06E1\u0631\u0650 \u0641\u064E\u0648\u06E1\u0642\u064E\u0647\u064F\u0645\u06E1 \u0635\u064E\u0640\u0670\u0653\u0641\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u064A\u064E\u0642\u06E1\u0628\u0650\u0636\u06E1\u0646\u064E\u06DA \u0645\u064E\u0627 \u064A\u064F\u0645\u06E1\u0633\u0650\u0643\u064F\u0647\u064F\u0646\u0651\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0628\u0650\u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0650\u06ED \u0628\u064E\u0635\u0650\u064A\u0631\u064C" }, { id: 20, text: "\u0623\u064E\u0645\u0651\u064E\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0647\u064F\u0648\u064E \u062C\u064F\u0646\u062F\u065E \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u064A\u064E\u0646\u0635\u064F\u0631\u064F\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650\u06DA \u0625\u0650\u0646\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u064A \u063A\u064F\u0631\u064F\u0648\u0631\u064D" }, { id: 21, text: "\u0623\u064E\u0645\u0651\u064E\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0631\u06E1\u0632\u064F\u0642\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0645\u06E1\u0633\u064E\u0643\u064E \u0631\u0650\u0632\u06E1\u0642\u064E\u0647\u064F\u06E5\u06DA \u0628\u064E\u0644 \u0644\u0651\u064E\u062C\u0651\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u0639\u064F\u062A\u064F\u0648\u0651\u0656 \u0648\u064E\u0646\u064F\u0641\u064F\u0648\u0631\u064D" }, { id: 22, text: "\u0623\u064E\u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0645\u06E1\u0634\u0650\u064A \u0645\u064F\u0643\u0650\u0628\u0651\u064B\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0648\u064E\u062C\u06E1\u0647\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0647\u06E1\u062F\u064E\u0649\u0670\u0653 \u0623\u064E\u0645\u0651\u064E\u0646 \u064A\u064E\u0645\u06E1\u0634\u0650\u064A \u0633\u064E\u0648\u0650\u064A\u0651\u064B\u0627 \u0639\u064E\u0644\u064E\u0649\u0670 \u0635\u0650\u0631\u064E\u0670\u0637\u0656 \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u0656" }, { id: 23, text: "\u0642\u064F\u0644\u06E1 \u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0634\u064E\u0623\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u0629\u064E\u06DA \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u062A\u064E\u0634\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0642\u064F\u0644\u06E1 \u0647\u064F\u0648\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0630\u064E\u0631\u064E\u0623\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064F\u062D\u06E1\u0634\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 25, text: "\u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0645\u064E\u062A\u064E\u0649\u0670 \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0648\u064E\u0639\u06E1\u062F\u064F \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0671\u0644\u06E1\u0639\u0650\u0644\u06E1\u0645\u064F \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u065E" }, { id: 27, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0647\u064F \u0632\u064F\u0644\u06E1\u0641\u064E\u0629\u0657 \u0633\u0650\u064A\u0653\u0640\u0654\u064E\u062A\u06E1 \u0648\u064F\u062C\u064F\u0648\u0647\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062A\u064E\u062F\u0651\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u064E\u0646\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0648\u064E\u0645\u064E\u0646 \u0645\u0651\u064E\u0639\u0650\u064A\u064E \u0623\u064E\u0648\u06E1 \u0631\u064E\u062D\u0650\u0645\u064E\u0646\u064E\u0627 \u0641\u064E\u0645\u064E\u0646 \u064A\u064F\u062C\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0645\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u0656" }, { id: 29, text: "\u0642\u064F\u0644\u06E1 \u0647\u064F\u0648\u064E \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6 \u0648\u064E\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064E\u0648\u064E\u0643\u0651\u064E\u0644\u06E1\u0646\u064E\u0627\u06D6 \u0641\u064E\u0633\u064E\u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0646\u06E1 \u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0636\u064E\u0644\u064E\u0670\u0644\u0656 \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u0656" }, { id: 30, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064F\u0645\u06E1 \u0625\u0650\u0646\u06E1 \u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064E \u0645\u064E\u0627\u0653\u0624\u064F\u0643\u064F\u0645\u06E1 \u063A\u064E\u0648\u06E1\u0631\u0657\u0627 \u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u0627\u0653\u0621\u0656 \u0645\u0651\u064E\u0639\u0650\u064A\u0646\u0650\u06ED" }] }, { id: 68, name: "\u0627\u0644\u0642\u0644\u0645", transliteration: "Al-Qalam", type: "meccan", total_verses: 52, verses: [{ id: 1, text: "\u0646\u0653\u06DA \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0644\u064E\u0645\u0650 \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0633\u06E1\u0637\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 2, text: "\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0628\u0650\u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0628\u0650\u0645\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u0656" }, { id: 3, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0643\u064E \u0644\u064E\u0623\u064E\u062C\u06E1\u0631\u064B\u0627 \u063A\u064E\u064A\u06E1\u0631\u064E \u0645\u064E\u0645\u06E1\u0646\u064F\u0648\u0646\u0656" }, { id: 4, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0644\u064E\u0639\u064E\u0644\u064E\u0649\u0670 \u062E\u064F\u0644\u064F\u0642\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 5, text: "\u0641\u064E\u0633\u064E\u062A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F \u0648\u064E\u064A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0628\u0650\u0623\u064E\u064A\u064A\u0651\u0650\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0641\u06E1\u062A\u064F\u0648\u0646\u064F" }, { id: 7, text: "\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0646 \u0636\u064E\u0644\u0651\u064E \u0639\u064E\u0646 \u0633\u064E\u0628\u0650\u064A\u0644\u0650\u0647\u0650\u06E6 \u0648\u064E\u0647\u064F\u0648\u064E \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u062A\u064E\u062F\u0650\u064A\u0646\u064E" }, { id: 8, text: "\u0641\u064E\u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u0639\u0650 \u0671\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 9, text: "\u0648\u064E\u062F\u0651\u064F\u0648\u0627\u0652 \u0644\u064E\u0648\u06E1 \u062A\u064F\u062F\u06E1\u0647\u0650\u0646\u064F \u0641\u064E\u064A\u064F\u062F\u06E1\u0647\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 10, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u0639\u06E1 \u0643\u064F\u0644\u0651\u064E \u062D\u064E\u0644\u0651\u064E\u0627\u0641\u0656 \u0645\u0651\u064E\u0647\u0650\u064A\u0646\u064D" }, { id: 11, text: "\u0647\u064E\u0645\u0651\u064E\u0627\u0632\u0656 \u0645\u0651\u064E\u0634\u0651\u064E\u0627\u0653\u0621\u0650\u06ED \u0628\u0650\u0646\u064E\u0645\u0650\u064A\u0645\u0656" }, { id: 12, text: "\u0645\u0651\u064E\u0646\u0651\u064E\u0627\u0639\u0656 \u0644\u0651\u0650\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650 \u0645\u064F\u0639\u06E1\u062A\u064E\u062F\u064D \u0623\u064E\u062B\u0650\u064A\u0645\u064D" }, { id: 13, text: "\u0639\u064F\u062A\u064F\u0644\u0651\u0650\u06ED \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0632\u064E\u0646\u0650\u064A\u0645\u064D" }, { id: 14, text: "\u0623\u064E\u0646 \u0643\u064E\u0627\u0646\u064E \u0630\u064E\u0627 \u0645\u064E\u0627\u0644\u0656 \u0648\u064E\u0628\u064E\u0646\u0650\u064A\u0646\u064E" }, { id: 15, text: "\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0633\u064E\u0670\u0637\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 16, text: "\u0633\u064E\u0646\u064E\u0633\u0650\u0645\u064F\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u062E\u064F\u0631\u06E1\u0637\u064F\u0648\u0645\u0650" }, { id: 17, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0628\u064E\u0644\u064E\u0648\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627 \u0628\u064E\u0644\u064E\u0648\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u0650 \u0625\u0650\u0630\u06E1 \u0623\u064E\u0642\u06E1\u0633\u064E\u0645\u064F\u0648\u0627\u0652 \u0644\u064E\u064A\u064E\u0635\u06E1\u0631\u0650\u0645\u064F\u0646\u0651\u064E\u0647\u064E\u0627 \u0645\u064F\u0635\u06E1\u0628\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u062B\u06E1\u0646\u064F\u0648\u0646\u064E" }, { id: 19, text: "\u0641\u064E\u0637\u064E\u0627\u0641\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0637\u064E\u0627\u0653\u0626\u0650\u0641\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0648\u064E\u0647\u064F\u0645\u06E1 \u0646\u064E\u0627\u0653\u0626\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0641\u064E\u0623\u064E\u0635\u06E1\u0628\u064E\u062D\u064E\u062A\u06E1 \u0643\u064E\u0671\u0644\u0635\u0651\u064E\u0631\u0650\u064A\u0645\u0650" }, { id: 21, text: "\u0641\u064E\u062A\u064E\u0646\u064E\u0627\u062F\u064E\u0648\u06E1\u0627\u0652 \u0645\u064F\u0635\u06E1\u0628\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 22, text: "\u0623\u064E\u0646\u0650 \u0671\u063A\u06E1\u062F\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u062D\u064E\u0631\u06E1\u062B\u0650\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u0635\u064E\u0670\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 23, text: "\u0641\u064E\u0671\u0646\u0637\u064E\u0644\u064E\u0642\u064F\u0648\u0627\u0652 \u0648\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u062A\u064E\u062E\u064E\u0670\u0641\u064E\u062A\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0623\u064E\u0646 \u0644\u0651\u064E\u0627 \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064E\u0646\u0651\u064E\u0647\u064E\u0627 \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u065E" }, { id: 25, text: "\u0648\u064E\u063A\u064E\u062F\u064E\u0648\u06E1\u0627\u0652 \u0639\u064E\u0644\u064E\u0649\u0670 \u062D\u064E\u0631\u06E1\u062F\u0656 \u0642\u064E\u0670\u062F\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 26, text: "\u0641\u064E\u0644\u064E\u0645\u0651\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0647\u064E\u0627 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0636\u064E\u0627\u0653\u0644\u0651\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0628\u064E\u0644\u06E1 \u0646\u064E\u062D\u06E1\u0646\u064F \u0645\u064E\u062D\u06E1\u0631\u064F\u0648\u0645\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0648\u06E1\u0633\u064E\u0637\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u0644\u064E\u0645\u06E1 \u0623\u064E\u0642\u064F\u0644 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0648\u06E1\u0644\u064E\u0627 \u062A\u064F\u0633\u064E\u0628\u0651\u0650\u062D\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0633\u064F\u0628\u06E1\u062D\u064E\u0670\u0646\u064E \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0638\u064E\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 30, text: "\u0641\u064E\u0623\u064E\u0642\u06E1\u0628\u064E\u0644\u064E \u0628\u064E\u0639\u06E1\u0636\u064F\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0628\u064E\u0639\u06E1\u0636\u0656 \u064A\u064E\u062A\u064E\u0644\u064E\u0670\u0648\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u064A\u064E\u0670\u0648\u064E\u064A\u06E1\u0644\u064E\u0646\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0637\u064E\u0670\u063A\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0639\u064E\u0633\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u064F\u0646\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u0628\u06E1\u062F\u0650\u0644\u064E\u0646\u064E\u0627 \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0631\u064E\u0670\u063A\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064F\u06D6 \u0648\u064E\u0644\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u06DA \u0644\u064E\u0648\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0650 \u0671\u0644\u0646\u0651\u064E\u0639\u0650\u064A\u0645\u0650" }, { id: 35, text: "\u0623\u064E\u0641\u064E\u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0643\u064E\u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 36, text: "\u0645\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0643\u0650\u062A\u064E\u0670\u0628\u065E \u0641\u0650\u064A\u0647\u0650 \u062A\u064E\u062F\u06E1\u0631\u064F\u0633\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0644\u064E\u0645\u064E\u0627 \u062A\u064E\u062E\u064E\u064A\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064C \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u064E\u0670\u0644\u0650\u063A\u064E\u0629\u064C \u0625\u0650\u0644\u064E\u0649\u0670 \u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650 \u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0645\u064E\u0627 \u062A\u064E\u062D\u06E1\u0643\u064F\u0645\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0633\u064E\u0644\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u064A\u0651\u064F\u0647\u064F\u0645 \u0628\u0650\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0632\u064E\u0639\u0650\u064A\u0645\u064C" }, { id: 41, text: "\u0623\u064E\u0645\u06E1 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0621\u064F \u0641\u064E\u0644\u06E1\u064A\u064E\u0623\u06E1\u062A\u064F\u0648\u0627\u0652 \u0628\u0650\u0634\u064F\u0631\u064E\u0643\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u06E1 \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0635\u064E\u0670\u062F\u0650\u0642\u0650\u064A\u0646\u064E" }, { id: 42, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0643\u06E1\u0634\u064E\u0641\u064F \u0639\u064E\u0646 \u0633\u064E\u0627\u0642\u0656 \u0648\u064E\u064A\u064F\u062F\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0633\u0651\u064F\u062C\u064F\u0648\u062F\u0650 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u062E\u064E\u0670\u0634\u0650\u0639\u064E\u0629\u064B \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F\u0647\u064F\u0645\u06E1 \u062A\u064E\u0631\u06E1\u0647\u064E\u0642\u064F\u0647\u064F\u0645\u06E1 \u0630\u0650\u0644\u0651\u064E\u0629\u065E\u06D6 \u0648\u064E\u0642\u064E\u062F\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u062F\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0633\u0651\u064F\u062C\u064F\u0648\u062F\u0650 \u0648\u064E\u0647\u064F\u0645\u06E1 \u0633\u064E\u0670\u0644\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0641\u064E\u0630\u064E\u0631\u06E1\u0646\u0650\u064A \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u062F\u0650\u064A\u062B\u0650\u06D6 \u0633\u064E\u0646\u064E\u0633\u06E1\u062A\u064E\u062F\u06E1\u0631\u0650\u062C\u064F\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062D\u064E\u064A\u06E1\u062B\u064F \u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u0623\u064F\u0645\u06E1\u0644\u0650\u064A \u0644\u064E\u0647\u064F\u0645\u06E1\u06DA \u0625\u0650\u0646\u0651\u064E \u0643\u064E\u064A\u06E1\u062F\u0650\u064A \u0645\u064E\u062A\u0650\u064A\u0646\u064C" }, { id: 46, text: "\u0623\u064E\u0645\u06E1 \u062A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u0657\u0627 \u0641\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u063A\u06E1\u0631\u064E\u0645\u0656 \u0645\u0651\u064F\u062B\u06E1\u0642\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0623\u064E\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u064F \u0641\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0643\u06E1\u062A\u064F\u0628\u064F\u0648\u0646\u064E" }, { id: 48, text: "\u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0644\u0650\u062D\u064F\u0643\u06E1\u0645\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0643\u064F\u0646 \u0643\u064E\u0635\u064E\u0627\u062D\u0650\u0628\u0650 \u0671\u0644\u06E1\u062D\u064F\u0648\u062A\u0650 \u0625\u0650\u0630\u06E1 \u0646\u064E\u0627\u062F\u064E\u0649\u0670 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064E\u0643\u06E1\u0638\u064F\u0648\u0645\u065E" }, { id: 49, text: "\u0644\u0651\u064E\u0648\u06E1\u0644\u064E\u0627\u0653 \u0623\u064E\u0646 \u062A\u064E\u062F\u064E\u0670\u0631\u064E\u0643\u064E\u0647\u064F\u06E5 \u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0644\u064E\u0646\u064F\u0628\u0650\u0630\u064E \u0628\u0650\u0671\u0644\u06E1\u0639\u064E\u0631\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0647\u064F\u0648\u064E \u0645\u064E\u0630\u06E1\u0645\u064F\u0648\u0645\u065E" }, { id: 50, text: "\u0641\u064E\u0671\u062C\u06E1\u062A\u064E\u0628\u064E\u0670\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u06E5 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646\u064E \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u0650\u064A\u0646\u064E" }, { id: 51, text: "\u0648\u064E\u0625\u0650\u0646 \u064A\u064E\u0643\u064E\u0627\u062F\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u064E\u064A\u064F\u0632\u06E1\u0644\u0650\u0642\u064F\u0648\u0646\u064E\u0643\u064E \u0628\u0650\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u0650\u0647\u0650\u0645\u06E1 \u0644\u064E\u0645\u0651\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u064F\u0648\u0627\u0652 \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0645\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u065E" }, { id: 52, text: "\u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }] }, { id: 69, name: "\u0627\u0644\u062D\u0627\u0642\u0629", transliteration: "Al-Haqqah", type: "meccan", total_verses: 52, verses: [{ id: 1, text: "\u0671\u0644\u06E1\u062D\u064E\u0627\u0653\u0642\u0651\u064E\u0629\u064F" }, { id: 2, text: "\u0645\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u0627\u0653\u0642\u0651\u064E\u0629\u064F" }, { id: 3, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u0671\u0644\u06E1\u062D\u064E\u0627\u0653\u0642\u0651\u064E\u0629\u064F" }, { id: 4, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u062B\u064E\u0645\u064F\u0648\u062F\u064F \u0648\u064E\u0639\u064E\u0627\u062F\u064F\u06E2 \u0628\u0650\u0671\u0644\u06E1\u0642\u064E\u0627\u0631\u0650\u0639\u064E\u0629\u0650" }, { id: 5, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u062B\u064E\u0645\u064F\u0648\u062F\u064F \u0641\u064E\u0623\u064F\u0647\u06E1\u0644\u0650\u0643\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0637\u0651\u064E\u0627\u063A\u0650\u064A\u064E\u0629\u0650" }, { id: 6, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0639\u064E\u0627\u062F\u065E \u0641\u064E\u0623\u064F\u0647\u06E1\u0644\u0650\u0643\u064F\u0648\u0627\u0652 \u0628\u0650\u0631\u0650\u064A\u062D\u0656 \u0635\u064E\u0631\u06E1\u0635\u064E\u0631\u064D \u0639\u064E\u0627\u062A\u0650\u064A\u064E\u0629\u0656" }, { id: 7, text: "\u0633\u064E\u062E\u0651\u064E\u0631\u064E\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0633\u064E\u0628\u06E1\u0639\u064E \u0644\u064E\u064A\u064E\u0627\u0644\u0656 \u0648\u064E\u062B\u064E\u0645\u064E\u0670\u0646\u0650\u064A\u064E\u0629\u064E \u0623\u064E\u064A\u0651\u064E\u0627\u0645\u064D \u062D\u064F\u0633\u064F\u0648\u0645\u0657\u0627\u06D6 \u0641\u064E\u062A\u064E\u0631\u064E\u0649 \u0671\u0644\u06E1\u0642\u064E\u0648\u06E1\u0645\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0635\u064E\u0631\u06E1\u0639\u064E\u0649\u0670 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u0639\u06E1\u062C\u064E\u0627\u0632\u064F \u0646\u064E\u062E\u06E1\u0644\u064D \u062E\u064E\u0627\u0648\u0650\u064A\u064E\u0629\u0656" }, { id: 8, text: "\u0641\u064E\u0647\u064E\u0644\u06E1 \u062A\u064E\u0631\u064E\u0649\u0670 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E2 \u0628\u064E\u0627\u0642\u0650\u064A\u064E\u0629\u0656" }, { id: 9, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0648\u064E\u0645\u064E\u0646 \u0642\u064E\u0628\u06E1\u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u062A\u064E\u0641\u0650\u0643\u064E\u0670\u062A\u064F \u0628\u0650\u0671\u0644\u06E1\u062E\u064E\u0627\u0637\u0650\u0626\u064E\u0629\u0650" }, { id: 10, text: "\u0641\u064E\u0639\u064E\u0635\u064E\u0648\u06E1\u0627\u0652 \u0631\u064E\u0633\u064F\u0648\u0644\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062E\u06E1\u0630\u064E\u0629\u0657 \u0631\u0651\u064E\u0627\u0628\u0650\u064A\u064E\u0629\u064B" }, { id: 11, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u0651\u064E\u0627 \u0637\u064E\u063A\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064F \u062D\u064E\u0645\u064E\u0644\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u062C\u064E\u0627\u0631\u0650\u064A\u064E\u0629\u0650" }, { id: 12, text: "\u0644\u0650\u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u064E\u0647\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u062A\u064E\u0630\u06E1\u0643\u0650\u0631\u064E\u0629\u0657 \u0648\u064E\u062A\u064E\u0639\u0650\u064A\u064E\u0647\u064E\u0627\u0653 \u0623\u064F\u0630\u064F\u0646\u065E \u0648\u064E\u0670\u0639\u0650\u064A\u064E\u0629\u065E" }, { id: 13, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0646\u064F\u0641\u0650\u062E\u064E \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u0648\u0631\u0650 \u0646\u064E\u0641\u06E1\u062E\u064E\u0629\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u065E" }, { id: 14, text: "\u0648\u064E\u062D\u064F\u0645\u0650\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0641\u064E\u062F\u064F\u0643\u0651\u064E\u062A\u064E\u0627 \u062F\u064E\u0643\u0651\u064E\u0629\u0657 \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u0657" }, { id: 15, text: "\u0641\u064E\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0648\u064E\u0642\u064E\u0639\u064E\u062A\u0650 \u0671\u0644\u06E1\u0648\u064E\u0627\u0642\u0650\u0639\u064E\u0629\u064F" }, { id: 16, text: "\u0648\u064E\u0671\u0646\u0634\u064E\u0642\u0651\u064E\u062A\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0641\u064E\u0647\u0650\u064A\u064E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0648\u064E\u0627\u0647\u0650\u064A\u064E\u0629\u065E" }, { id: 17, text: "\u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0643\u064F \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0631\u06E1\u062C\u064E\u0627\u0653\u0626\u0650\u0647\u064E\u0627\u06DA \u0648\u064E\u064A\u064E\u062D\u06E1\u0645\u0650\u0644\u064F \u0639\u064E\u0631\u06E1\u0634\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u0648\u06E1\u0642\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u062B\u064E\u0645\u064E\u0670\u0646\u0650\u064A\u064E\u0629\u065E" }, { id: 18, text: "\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u062A\u064F\u0639\u06E1\u0631\u064E\u0636\u064F\u0648\u0646\u064E \u0644\u064E\u0627 \u062A\u064E\u062E\u06E1\u0641\u064E\u0649\u0670 \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u062E\u064E\u0627\u0641\u0650\u064A\u064E\u0629\u065E" }, { id: 19, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u064E\u0647\u064F\u06E5 \u0628\u0650\u064A\u064E\u0645\u0650\u064A\u0646\u0650\u0647\u0650\u06E6 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0647\u064E\u0627\u0653\u0624\u064F\u0645\u064F \u0671\u0642\u06E1\u0631\u064E\u0621\u064F\u0648\u0627\u0652 \u0643\u0650\u062A\u064E\u0670\u0628\u0650\u064A\u064E\u0647\u06E1" }, { id: 20, text: "\u0625\u0650\u0646\u0651\u0650\u064A \u0638\u064E\u0646\u064E\u0646\u062A\u064F \u0623\u064E\u0646\u0651\u0650\u064A \u0645\u064F\u0644\u064E\u0670\u0642\u064D \u062D\u0650\u0633\u064E\u0627\u0628\u0650\u064A\u064E\u0647\u06E1" }, { id: 21, text: "\u0641\u064E\u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0639\u0650\u064A\u0634\u064E\u0629\u0656 \u0631\u0651\u064E\u0627\u0636\u0650\u064A\u064E\u0629\u0656" }, { id: 22, text: "\u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0629\u064D \u0639\u064E\u0627\u0644\u0650\u064A\u064E\u0629\u0656" }, { id: 23, text: "\u0642\u064F\u0637\u064F\u0648\u0641\u064F\u0647\u064E\u0627 \u062F\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u065E" }, { id: 24, text: "\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0634\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0647\u064E\u0646\u0650\u064A\u0653\u0640\u0654\u064E\u06E2\u0627 \u0628\u0650\u0645\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0644\u064E\u0641\u06E1\u062A\u064F\u0645\u06E1 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u064A\u0651\u064E\u0627\u0645\u0650 \u0671\u0644\u06E1\u062E\u064E\u0627\u0644\u0650\u064A\u064E\u0629\u0650" }, { id: 25, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u064E\u0647\u064F\u06E5 \u0628\u0650\u0634\u0650\u0645\u064E\u0627\u0644\u0650\u0647\u0650\u06E6 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0644\u064E\u0645\u06E1 \u0623\u064F\u0648\u062A\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u0650\u064A\u064E\u0647\u06E1" }, { id: 26, text: "\u0648\u064E\u0644\u064E\u0645\u06E1 \u0623\u064E\u062F\u06E1\u0631\u0650 \u0645\u064E\u0627 \u062D\u0650\u0633\u064E\u0627\u0628\u0650\u064A\u064E\u0647\u06E1" }, { id: 27, text: "\u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E\u0647\u064E\u0627 \u0643\u064E\u0627\u0646\u064E\u062A\u0650 \u0671\u0644\u06E1\u0642\u064E\u0627\u0636\u0650\u064A\u064E\u0629\u064E" }, { id: 28, text: "\u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670 \u0639\u064E\u0646\u0651\u0650\u064A \u0645\u064E\u0627\u0644\u0650\u064A\u064E\u0647\u06E1\u06DC" }, { id: 29, text: "\u0647\u064E\u0644\u064E\u0643\u064E \u0639\u064E\u0646\u0651\u0650\u064A \u0633\u064F\u0644\u06E1\u0637\u064E\u0670\u0646\u0650\u064A\u064E\u0647\u06E1" }, { id: 30, text: "\u062E\u064F\u0630\u064F\u0648\u0647\u064F \u0641\u064E\u063A\u064F\u0644\u0651\u064F\u0648\u0647\u064F" }, { id: 31, text: "\u062B\u064F\u0645\u0651\u064E \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u064E \u0635\u064E\u0644\u0651\u064F\u0648\u0647\u064F" }, { id: 32, text: "\u062B\u064F\u0645\u0651\u064E \u0641\u0650\u064A \u0633\u0650\u0644\u06E1\u0633\u0650\u0644\u064E\u0629\u0656 \u0630\u064E\u0631\u06E1\u0639\u064F\u0647\u064E\u0627 \u0633\u064E\u0628\u06E1\u0639\u064F\u0648\u0646\u064E \u0630\u0650\u0631\u064E\u0627\u0639\u0657\u0627 \u0641\u064E\u0671\u0633\u06E1\u0644\u064F\u0643\u064F\u0648\u0647\u064F" }, { id: 33, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 34, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u064F\u0636\u0651\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0637\u064E\u0639\u064E\u0627\u0645\u0650 \u0671\u0644\u06E1\u0645\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u0650" }, { id: 35, text: "\u0641\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0647\u064E\u0670\u0647\u064F\u0646\u064E\u0627 \u062D\u064E\u0645\u0650\u064A\u0645\u065E" }, { id: 36, text: "\u0648\u064E\u0644\u064E\u0627 \u0637\u064E\u0639\u064E\u0627\u0645\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646\u06E1 \u063A\u0650\u0633\u06E1\u0644\u0650\u064A\u0646\u0656" }, { id: 37, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u062E\u064E\u0670\u0637\u0650\u0640\u0654\u064F\u0648\u0646\u064E" }, { id: 38, text: "\u0641\u064E\u0644\u064E\u0627\u0653 \u0623\u064F\u0642\u06E1\u0633\u0650\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u062A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 39, text: "\u0648\u064E\u0645\u064E\u0627 \u0644\u064E\u0627 \u062A\u064F\u0628\u06E1\u0635\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0642\u064E\u0648\u06E1\u0644\u064F \u0631\u064E\u0633\u064F\u0648\u0644\u0656 \u0643\u064E\u0631\u0650\u064A\u0645\u0656" }, { id: 41, text: "\u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0628\u0650\u0642\u064E\u0648\u06E1\u0644\u0650 \u0634\u064E\u0627\u0639\u0650\u0631\u0656\u06DA \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u062A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 42, text: "\u0648\u064E\u0644\u064E\u0627 \u0628\u0650\u0642\u064E\u0648\u06E1\u0644\u0650 \u0643\u064E\u0627\u0647\u0650\u0646\u0656\u06DA \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627 \u0645\u0651\u064E\u0627 \u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u062A\u064E\u0646\u0632\u0650\u064A\u0644\u065E \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 44, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u062A\u064E\u0642\u064E\u0648\u0651\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u064E\u0639\u06E1\u0636\u064E \u0671\u0644\u06E1\u0623\u064E\u0642\u064E\u0627\u0648\u0650\u064A\u0644\u0650" }, { id: 45, text: "\u0644\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F \u0628\u0650\u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650" }, { id: 46, text: "\u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0642\u064E\u0637\u064E\u0639\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u06E1\u0647\u064F \u0671\u0644\u06E1\u0648\u064E\u062A\u0650\u064A\u0646\u064E" }, { id: 47, text: "\u0641\u064E\u0645\u064E\u0627 \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u062D\u064E\u062F\u064D \u0639\u064E\u0646\u06E1\u0647\u064F \u062D\u064E\u0670\u062C\u0650\u0632\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u062A\u064E\u0630\u06E1\u0643\u0650\u0631\u064E\u0629\u065E \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0646\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0623\u064E\u0646\u0651\u064E \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u062D\u064E\u0633\u06E1\u0631\u064E\u0629\u064C \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 51, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u062D\u064E\u0642\u0651\u064F \u0671\u0644\u06E1\u064A\u064E\u0642\u0650\u064A\u0646\u0650" }, { id: 52, text: "\u0641\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u0671\u0633\u06E1\u0645\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }] }, { id: 70, name: "\u0627\u0644\u0645\u0639\u0627\u0631\u062C", transliteration: "Al-Ma'arij", type: "meccan", total_verses: 44, verses: [{ id: 1, text: "\u0633\u064E\u0623\u064E\u0644\u064E \u0633\u064E\u0627\u0653\u0626\u0650\u0644\u064F\u06E2 \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u0656 \u0648\u064E\u0627\u0642\u0650\u0639\u0656" }, { id: 2, text: "\u0644\u0651\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0644\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064F\u06E5 \u062F\u064E\u0627\u0641\u0650\u0639\u065E" }, { id: 3, text: "\u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0630\u0650\u064A \u0671\u0644\u06E1\u0645\u064E\u0639\u064E\u0627\u0631\u0650\u062C\u0650" }, { id: 4, text: "\u062A\u064E\u0639\u06E1\u0631\u064F\u062C\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0648\u064E\u0671\u0644\u0631\u0651\u064F\u0648\u062D\u064F \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u0641\u0650\u064A \u064A\u064E\u0648\u06E1\u0645\u0656 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0642\u06E1\u062F\u064E\u0627\u0631\u064F\u0647\u064F\u06E5 \u062E\u064E\u0645\u06E1\u0633\u0650\u064A\u0646\u064E \u0623\u064E\u0644\u06E1\u0641\u064E \u0633\u064E\u0646\u064E\u0629\u0656" }, { id: 5, text: "\u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0635\u064E\u0628\u06E1\u0631\u0657\u0627 \u062C\u064E\u0645\u0650\u064A\u0644\u064B\u0627" }, { id: 6, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E\u0647\u064F\u06E5 \u0628\u064E\u0639\u0650\u064A\u062F\u0657\u0627" }, { id: 7, text: "\u0648\u064E\u0646\u064E\u0631\u064E\u0649\u0670\u0647\u064F \u0642\u064E\u0631\u0650\u064A\u0628\u0657\u0627" }, { id: 8, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0643\u064E\u0671\u0644\u06E1\u0645\u064F\u0647\u06E1\u0644\u0650" }, { id: 9, text: "\u0648\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0643\u064E\u0671\u0644\u06E1\u0639\u0650\u0647\u06E1\u0646\u0650" }, { id: 10, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F \u062D\u064E\u0645\u0650\u064A\u0645\u064C \u062D\u064E\u0645\u0650\u064A\u0645\u0657\u0627" }, { id: 11, text: "\u064A\u064F\u0628\u064E\u0635\u0651\u064E\u0631\u064F\u0648\u0646\u064E\u0647\u064F\u0645\u06E1\u06DA \u064A\u064E\u0648\u064E\u062F\u0651\u064F \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u064F \u0644\u064E\u0648\u06E1 \u064A\u064E\u0641\u06E1\u062A\u064E\u062F\u0650\u064A \u0645\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u064A\u064E\u0648\u06E1\u0645\u0650\u0626\u0650\u0630\u0650\u06ED \u0628\u0650\u0628\u064E\u0646\u0650\u064A\u0647\u0650" }, { id: 12, text: "\u0648\u064E\u0635\u064E\u0670\u062D\u0650\u0628\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u062E\u0650\u064A\u0647\u0650" }, { id: 13, text: "\u0648\u064E\u0641\u064E\u0635\u0650\u064A\u0644\u064E\u062A\u0650\u0647\u0650 \u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062A\u064F\u0640\u0654\u06E1\u0648\u0650\u064A\u0647\u0650" }, { id: 14, text: "\u0648\u064E\u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u062C\u064E\u0645\u0650\u064A\u0639\u0657\u0627 \u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0646\u062C\u0650\u064A\u0647\u0650" }, { id: 15, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0644\u064E\u0638\u064E\u0649\u0670" }, { id: 16, text: "\u0646\u064E\u0632\u0651\u064E\u0627\u0639\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0634\u0651\u064E\u0648\u064E\u0649\u0670" }, { id: 17, text: "\u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0646\u06E1 \u0623\u064E\u062F\u06E1\u0628\u064E\u0631\u064E \u0648\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670" }, { id: 18, text: "\u0648\u064E\u062C\u064E\u0645\u064E\u0639\u064E \u0641\u064E\u0623\u064E\u0648\u06E1\u0639\u064E\u0649\u0670\u0653" }, { id: 19, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u062E\u064F\u0644\u0650\u0642\u064E \u0647\u064E\u0644\u064F\u0648\u0639\u064B\u0627" }, { id: 20, text: "\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E\u0647\u064F \u0671\u0644\u0634\u0651\u064E\u0631\u0651\u064F \u062C\u064E\u0632\u064F\u0648\u0639\u0657\u0627" }, { id: 21, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0633\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u064F \u0645\u064E\u0646\u064F\u0648\u0639\u064B\u0627" }, { id: 22, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0635\u064E\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 23, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0635\u064E\u0644\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u062F\u064E\u0627\u0653\u0626\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u0642\u0651\u065E \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u065E" }, { id: 25, text: "\u0644\u0651\u0650\u0644\u0633\u0651\u064E\u0627\u0653\u0626\u0650\u0644\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u062D\u06E1\u0631\u064F\u0648\u0645\u0650" }, { id: 26, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0635\u064E\u062F\u0651\u0650\u0642\u064F\u0648\u0646\u064E \u0628\u0650\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 27, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u0634\u06E1\u0641\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 28, text: "\u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064E\u0623\u06E1\u0645\u064F\u0648\u0646\u0656" }, { id: 29, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0644\u0650\u0641\u064F\u0631\u064F\u0648\u062C\u0650\u0647\u0650\u0645\u06E1 \u062D\u064E\u0670\u0641\u0650\u0638\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0650\u0647\u0650\u0645\u06E1 \u0623\u064E\u0648\u06E1 \u0645\u064E\u0627 \u0645\u064E\u0644\u064E\u0643\u064E\u062A\u06E1 \u0623\u064E\u064A\u06E1\u0645\u064E\u0670\u0646\u064F\u0647\u064F\u0645\u06E1 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064E\u0644\u064F\u0648\u0645\u0650\u064A\u0646\u064E" }, { id: 31, text: "\u0641\u064E\u0645\u064E\u0646\u0650 \u0671\u0628\u06E1\u062A\u064E\u063A\u064E\u0649\u0670 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0639\u064E\u0627\u062F\u064F\u0648\u0646\u064E" }, { id: 32, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0644\u0650\u0623\u064E\u0645\u064E\u0670\u0646\u064E\u0670\u062A\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0639\u064E\u0647\u06E1\u062F\u0650\u0647\u0650\u0645\u06E1 \u0631\u064E\u0670\u0639\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645 \u0628\u0650\u0634\u064E\u0647\u064E\u0670\u062F\u064E\u0670\u062A\u0650\u0647\u0650\u0645\u06E1 \u0642\u064E\u0627\u0653\u0626\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 34, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0635\u064E\u0644\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u064A\u064F\u062D\u064E\u0627\u0641\u0650\u0638\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0645\u0651\u064F\u0643\u06E1\u0631\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0641\u064E\u0645\u064E\u0627\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0642\u0650\u0628\u064E\u0644\u064E\u0643\u064E \u0645\u064F\u0647\u06E1\u0637\u0650\u0639\u0650\u064A\u0646\u064E" }, { id: 37, text: "\u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650 \u0648\u064E\u0639\u064E\u0646\u0650 \u0671\u0644\u0634\u0651\u0650\u0645\u064E\u0627\u0644\u0650 \u0639\u0650\u0632\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u0623\u064E\u064A\u064E\u0637\u06E1\u0645\u064E\u0639\u064F \u0643\u064F\u0644\u0651\u064F \u0671\u0645\u06E1\u0631\u0650\u064A\u0655\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064F\u062F\u06E1\u062E\u064E\u0644\u064E \u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0646\u064E\u0639\u0650\u064A\u0645\u0656" }, { id: 39, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 40, text: "\u0641\u064E\u0644\u064E\u0627\u0653 \u0623\u064F\u0642\u06E1\u0633\u0650\u0645\u064F \u0628\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0645\u064E\u0634\u064E\u0670\u0631\u0650\u0642\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u063A\u064E\u0670\u0631\u0650\u0628\u0650 \u0625\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0642\u064E\u0670\u062F\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 41, text: "\u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u0646\u0651\u064F\u0628\u064E\u062F\u0651\u0650\u0644\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0628\u0650\u0645\u064E\u0633\u06E1\u0628\u064F\u0648\u0642\u0650\u064A\u0646\u064E" }, { id: 42, text: "\u0641\u064E\u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u062E\u064F\u0648\u0636\u064F\u0648\u0627\u0652 \u0648\u064E\u064A\u064E\u0644\u06E1\u0639\u064E\u0628\u064F\u0648\u0627\u0652 \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u064A\u064F\u0644\u064E\u0670\u0642\u064F\u0648\u0627\u0652 \u064A\u064E\u0648\u06E1\u0645\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u062C\u06E1\u062F\u064E\u0627\u062B\u0650 \u0633\u0650\u0631\u064E\u0627\u0639\u0657\u0627 \u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0646\u064F\u0635\u064F\u0628\u0656 \u064A\u064F\u0648\u0641\u0650\u0636\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u062E\u064E\u0670\u0634\u0650\u0639\u064E\u0629\u064B \u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F\u0647\u064F\u0645\u06E1 \u062A\u064E\u0631\u06E1\u0647\u064E\u0642\u064F\u0647\u064F\u0645\u06E1 \u0630\u0650\u0644\u0651\u064E\u0629\u065E\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E" }] }, { id: 71, name: "\u0646\u0648\u062D", transliteration: "Nuh", type: "meccan", total_verses: 28, verses: [{ id: 1, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627 \u0646\u064F\u0648\u062D\u064B\u0627 \u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u0648\u06E1\u0645\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u0646\u06E1 \u0623\u064E\u0646\u0630\u0650\u0631\u06E1 \u0642\u064E\u0648\u06E1\u0645\u064E\u0643\u064E \u0645\u0650\u0646 \u0642\u064E\u0628\u06E1\u0644\u0650 \u0623\u064E\u0646 \u064A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064C \u0623\u064E\u0644\u0650\u064A\u0645\u065E" }, { id: 2, text: "\u0642\u064E\u0627\u0644\u064E \u064A\u064E\u0670\u0642\u064E\u0648\u06E1\u0645\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0643\u064F\u0645\u06E1 \u0646\u064E\u0630\u0650\u064A\u0631\u065E \u0645\u0651\u064F\u0628\u0650\u064A\u0646\u064C" }, { id: 3, text: "\u0623\u064E\u0646\u0650 \u0671\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064F\u0648\u0647\u064F \u0648\u064E\u0623\u064E\u0637\u0650\u064A\u0639\u064F\u0648\u0646\u0650" }, { id: 4, text: "\u064A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646 \u0630\u064F\u0646\u064F\u0648\u0628\u0650\u0643\u064F\u0645\u06E1 \u0648\u064E\u064A\u064F\u0624\u064E\u062E\u0651\u0650\u0631\u06E1\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u062C\u064E\u0644\u0656 \u0645\u0651\u064F\u0633\u064E\u0645\u0651\u064B\u0649\u06DA \u0625\u0650\u0646\u0651\u064E \u0623\u064E\u062C\u064E\u0644\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0644\u064E\u0627 \u064A\u064F\u0624\u064E\u062E\u0651\u064E\u0631\u064F\u06DA \u0644\u064E\u0648\u06E1 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0642\u064E\u0627\u0644\u064E \u0631\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u0650\u064A \u062F\u064E\u0639\u064E\u0648\u06E1\u062A\u064F \u0642\u064E\u0648\u06E1\u0645\u0650\u064A \u0644\u064E\u064A\u06E1\u0644\u0657\u0627 \u0648\u064E\u0646\u064E\u0647\u064E\u0627\u0631\u0657\u0627" }, { id: 6, text: "\u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0632\u0650\u062F\u06E1\u0647\u064F\u0645\u06E1 \u062F\u064F\u0639\u064E\u0627\u0653\u0621\u0650\u064A\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u0631\u064E\u0627\u0631\u0657\u0627" }, { id: 7, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u0650\u064A \u0643\u064F\u0644\u0651\u064E\u0645\u064E\u0627 \u062F\u064E\u0639\u064E\u0648\u06E1\u062A\u064F\u0647\u064F\u0645\u06E1 \u0644\u0650\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0639\u064E\u0644\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0635\u064E\u0670\u0628\u0650\u0639\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0653 \u0621\u064E\u0627\u0630\u064E\u0627\u0646\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0634\u064E\u0648\u06E1\u0627\u0652 \u062B\u0650\u064A\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0635\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u0671\u0633\u06E1\u062A\u0650\u0643\u06E1\u0628\u064E\u0627\u0631\u0657\u0627" }, { id: 8, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u0650\u064A \u062F\u064E\u0639\u064E\u0648\u06E1\u062A\u064F\u0647\u064F\u0645\u06E1 \u062C\u0650\u0647\u064E\u0627\u0631\u0657\u0627" }, { id: 9, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u0650\u064A\u0653 \u0623\u064E\u0639\u06E1\u0644\u064E\u0646\u062A\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0648\u064E\u0623\u064E\u0633\u06E1\u0631\u064E\u0631\u06E1\u062A\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0633\u06E1\u0631\u064E\u0627\u0631\u0657\u0627" }, { id: 10, text: "\u0641\u064E\u0642\u064F\u0644\u06E1\u062A\u064F \u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u063A\u064E\u0641\u0651\u064E\u0627\u0631\u0657\u0627" }, { id: 11, text: "\u064A\u064F\u0631\u06E1\u0633\u0650\u0644\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645 \u0645\u0651\u0650\u062F\u06E1\u0631\u064E\u0627\u0631\u0657\u0627" }, { id: 12, text: "\u0648\u064E\u064A\u064F\u0645\u06E1\u062F\u0650\u062F\u06E1\u0643\u064F\u0645 \u0628\u0650\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u0644\u0656 \u0648\u064E\u0628\u064E\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u0648\u064E\u064A\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u0657\u0627" }, { id: 13, text: "\u0645\u0651\u064E\u0627 \u0644\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0627 \u062A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0642\u064E\u0627\u0631\u0657\u0627" }, { id: 14, text: "\u0648\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064F\u0645\u06E1 \u0623\u064E\u0637\u06E1\u0648\u064E\u0627\u0631\u064B\u0627" }, { id: 15, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E\u0648\u06E1\u0627\u0652 \u0643\u064E\u064A\u06E1\u0641\u064E \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0633\u064E\u0628\u06E1\u0639\u064E \u0633\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0656 \u0637\u0650\u0628\u064E\u0627\u0642\u0657\u0627" }, { id: 16, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064E \u0641\u0650\u064A\u0647\u0650\u0646\u0651\u064E \u0646\u064F\u0648\u0631\u0657\u0627 \u0648\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064E \u0633\u0650\u0631\u064E\u0627\u062C\u0657\u0627" }, { id: 17, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u064E\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0646\u064E\u0628\u064E\u0627\u062A\u0657\u0627" }, { id: 18, text: "\u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0639\u0650\u064A\u062F\u064F\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u064A\u064F\u062E\u06E1\u0631\u0650\u062C\u064F\u0643\u064F\u0645\u06E1 \u0625\u0650\u062E\u06E1\u0631\u064E\u0627\u062C\u0657\u0627" }, { id: 19, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u062C\u064E\u0639\u064E\u0644\u064E \u0644\u064E\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u0650\u0633\u064E\u0627\u0637\u0657\u0627" }, { id: 20, text: "\u0644\u0651\u0650\u062A\u064E\u0633\u06E1\u0644\u064F\u0643\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0633\u064F\u0628\u064F\u0644\u0657\u0627 \u0641\u0650\u062C\u064E\u0627\u062C\u0657\u0627" }, { id: 21, text: "\u0642\u064E\u0627\u0644\u064E \u0646\u064F\u0648\u062D\u065E \u0631\u0651\u064E\u0628\u0651\u0650 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0635\u064E\u0648\u06E1\u0646\u0650\u064A \u0648\u064E\u0671\u062A\u0651\u064E\u0628\u064E\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0632\u0650\u062F\u06E1\u0647\u064F \u0645\u064E\u0627\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0648\u064E\u0644\u064E\u062F\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u062E\u064E\u0633\u064E\u0627\u0631\u0657\u0627" }, { id: 22, text: "\u0648\u064E\u0645\u064E\u0643\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u064E\u0643\u06E1\u0631\u0657\u0627 \u0643\u064F\u0628\u0651\u064E\u0627\u0631\u0657\u0627" }, { id: 23, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0631\u064F\u0646\u0651\u064E \u0621\u064E\u0627\u0644\u0650\u0647\u064E\u062A\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0631\u064F\u0646\u0651\u064E \u0648\u064E\u062F\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0633\u064F\u0648\u064E\u0627\u0639\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u063A\u064F\u0648\u062B\u064E \u0648\u064E\u064A\u064E\u0639\u064F\u0648\u0642\u064E \u0648\u064E\u0646\u064E\u0633\u06E1\u0631\u0657\u0627" }, { id: 24, text: "\u0648\u064E\u0642\u064E\u062F\u06E1 \u0623\u064E\u0636\u064E\u0644\u0651\u064F\u0648\u0627\u0652 \u0643\u064E\u062B\u0650\u064A\u0631\u0657\u0627\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0632\u0650\u062F\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0636\u064E\u0644\u064E\u0670\u0644\u0657\u0627" }, { id: 25, text: "\u0645\u0651\u0650\u0645\u0651\u064E\u0627 \u062E\u064E\u0637\u0650\u064A\u0653\u0640\u0654\u064E\u0670\u062A\u0650\u0647\u0650\u0645\u06E1 \u0623\u064F\u063A\u06E1\u0631\u0650\u0642\u064F\u0648\u0627\u0652 \u0641\u064E\u0623\u064F\u062F\u06E1\u062E\u0650\u0644\u064F\u0648\u0627\u0652 \u0646\u064E\u0627\u0631\u0657\u0627 \u0641\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062C\u0650\u062F\u064F\u0648\u0627\u0652 \u0644\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062F\u064F\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0646\u0635\u064E\u0627\u0631\u0657\u0627" }, { id: 26, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0646\u064F\u0648\u062D\u065E \u0631\u0651\u064E\u0628\u0651\u0650 \u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0631\u06E1 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u062F\u064E\u064A\u0651\u064E\u0627\u0631\u064B\u0627" }, { id: 27, text: "\u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0625\u0650\u0646 \u062A\u064E\u0630\u064E\u0631\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064F\u0636\u0650\u0644\u0651\u064F\u0648\u0627\u0652 \u0639\u0650\u0628\u064E\u0627\u062F\u064E\u0643\u064E \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0644\u0650\u062F\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u064E\u0627\u062C\u0650\u0631\u0657\u0627 \u0643\u064E\u0641\u0651\u064E\u0627\u0631\u0657\u0627" }, { id: 28, text: "\u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u063A\u06E1\u0641\u0650\u0631\u06E1 \u0644\u0650\u064A \u0648\u064E\u0644\u0650\u0648\u064E\u0670\u0644\u0650\u062F\u064E\u064A\u0651\u064E \u0648\u064E\u0644\u0650\u0645\u064E\u0646 \u062F\u064E\u062E\u064E\u0644\u064E \u0628\u064E\u064A\u06E1\u062A\u0650\u064A\u064E \u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0657\u0627 \u0648\u064E\u0644\u0650\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650\u06D6 \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0632\u0650\u062F\u0650 \u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u062A\u064E\u0628\u064E\u0627\u0631\u064E\u06E2\u0627" }] }, { id: 72, name: "\u0627\u0644\u062C\u0646", transliteration: "Al-Jinn", type: "meccan", total_verses: 28, verses: [{ id: 1, text: "\u0642\u064F\u0644\u06E1 \u0623\u064F\u0648\u062D\u0650\u064A\u064E \u0625\u0650\u0644\u064E\u064A\u0651\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F \u0671\u0633\u06E1\u062A\u064E\u0645\u064E\u0639\u064E \u0646\u064E\u0641\u064E\u0631\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0641\u064E\u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064B\u0627 \u0639\u064E\u062C\u064E\u0628\u0657\u0627" }, { id: 2, text: "\u064A\u064E\u0647\u06E1\u062F\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0631\u0651\u064F\u0634\u06E1\u062F\u0650 \u0641\u064E\u0640\u0654\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0648\u064E\u0644\u064E\u0646 \u0646\u0651\u064F\u0634\u06E1\u0631\u0650\u0643\u064E \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627\u0653 \u0623\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 3, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u062A\u064E\u0639\u064E\u0670\u0644\u064E\u0649\u0670 \u062C\u064E\u062F\u0651\u064F \u0631\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u0645\u064E\u0627 \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0635\u064E\u0670\u062D\u0650\u0628\u064E\u0629\u0657 \u0648\u064E\u0644\u064E\u0627 \u0648\u064E\u0644\u064E\u062F\u0657\u0627" }, { id: 4, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0633\u064E\u0641\u0650\u064A\u0647\u064F\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0634\u064E\u0637\u064E\u0637\u0657\u0627" }, { id: 5, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0627 \u0638\u064E\u0646\u064E\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u062A\u064E\u0642\u064F\u0648\u0644\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064F \u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0643\u064E\u0630\u0650\u0628\u0657\u0627" }, { id: 6, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0631\u0650\u062C\u064E\u0627\u0644\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u0650 \u064A\u064E\u0639\u064F\u0648\u0630\u064F\u0648\u0646\u064E \u0628\u0650\u0631\u0650\u062C\u064E\u0627\u0644\u0656 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u0650 \u0641\u064E\u0632\u064E\u0627\u062F\u064F\u0648\u0647\u064F\u0645\u06E1 \u0631\u064E\u0647\u064E\u0642\u0657\u0627" }, { id: 7, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0638\u064E\u0646\u0651\u064F\u0648\u0627\u0652 \u0643\u064E\u0645\u064E\u0627 \u0638\u064E\u0646\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u064A\u064E\u0628\u06E1\u0639\u064E\u062B\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 8, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064E\u0633\u06E1\u0646\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064E \u0641\u064E\u0648\u064E\u062C\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064E\u0627 \u0645\u064F\u0644\u0650\u0626\u064E\u062A\u06E1 \u062D\u064E\u0631\u064E\u0633\u0657\u0627 \u0634\u064E\u062F\u0650\u064A\u062F\u0657\u0627 \u0648\u064E\u0634\u064F\u0647\u064F\u0628\u0657\u0627" }, { id: 9, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u0642\u06E1\u0639\u064F\u062F\u064F \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0645\u064E\u0642\u064E\u0670\u0639\u0650\u062F\u064E \u0644\u0650\u0644\u0633\u0651\u064E\u0645\u06E1\u0639\u0650\u06D6 \u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0645\u0650\u0639\u0650 \u0671\u0644\u06E1\u0623\u0653\u0646\u064E \u064A\u064E\u062C\u0650\u062F\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0634\u0650\u0647\u064E\u0627\u0628\u0657\u0627 \u0631\u0651\u064E\u0635\u064E\u062F\u0657\u0627" }, { id: 10, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0627 \u0644\u064E\u0627 \u0646\u064E\u062F\u06E1\u0631\u0650\u064A\u0653 \u0623\u064E\u0634\u064E\u0631\u0651\u064C \u0623\u064F\u0631\u0650\u064A\u062F\u064E \u0628\u0650\u0645\u064E\u0646 \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0623\u064E\u0645\u06E1 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0628\u0650\u0647\u0650\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u06E1 \u0631\u064E\u0634\u064E\u062F\u0657\u0627" }, { id: 11, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0627 \u0645\u0650\u0646\u0651\u064E\u0627 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u0650\u0646\u0651\u064E\u0627 \u062F\u064F\u0648\u0646\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E\u06D6 \u0643\u064F\u0646\u0651\u064E\u0627 \u0637\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0642\u064E \u0642\u0650\u062F\u064E\u062F\u0657\u0627" }, { id: 12, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0627 \u0638\u064E\u0646\u064E\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u0646\u0651\u064F\u0639\u06E1\u062C\u0650\u0632\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0644\u064E\u0646 \u0646\u0651\u064F\u0639\u06E1\u062C\u0650\u0632\u064E\u0647\u064F\u06E5 \u0647\u064E\u0631\u064E\u0628\u0657\u0627" }, { id: 13, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u0651\u064E\u0627 \u0633\u064E\u0645\u0650\u0639\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670\u0653 \u0621\u064E\u0627\u0645\u064E\u0646\u0651\u064E\u0627 \u0628\u0650\u0647\u0650\u06E6\u06D6 \u0641\u064E\u0645\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u06E2 \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u062E\u064E\u0627\u0641\u064F \u0628\u064E\u062E\u06E1\u0633\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0631\u064E\u0647\u064E\u0642\u0657\u0627" }, { id: 14, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0627 \u0645\u0650\u0646\u0651\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u0644\u0650\u0645\u064F\u0648\u0646\u064E \u0648\u064E\u0645\u0650\u0646\u0651\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0670\u0633\u0650\u0637\u064F\u0648\u0646\u064E\u06D6 \u0641\u064E\u0645\u064E\u0646\u06E1 \u0623\u064E\u0633\u06E1\u0644\u064E\u0645\u064E \u0641\u064E\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u062A\u064E\u062D\u064E\u0631\u0651\u064E\u0648\u06E1\u0627\u0652 \u0631\u064E\u0634\u064E\u062F\u0657\u0627" }, { id: 15, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0670\u0633\u0650\u0637\u064F\u0648\u0646\u064E \u0641\u064E\u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u0650\u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062D\u064E\u0637\u064E\u0628\u0657\u0627" }, { id: 16, text: "\u0648\u064E\u0623\u064E\u0644\u0651\u064E\u0648\u0650 \u0671\u0633\u06E1\u062A\u064E\u0642\u064E\u0670\u0645\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0637\u0651\u064E\u0631\u0650\u064A\u0642\u064E\u0629\u0650 \u0644\u064E\u0623\u064E\u0633\u06E1\u0642\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F\u0645 \u0645\u0651\u064E\u0627\u0653\u0621\u064B \u063A\u064E\u062F\u064E\u0642\u0657\u0627" }, { id: 17, text: "\u0644\u0651\u0650\u0646\u064E\u0641\u06E1\u062A\u0650\u0646\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064F\u0639\u06E1\u0631\u0650\u0636\u06E1 \u0639\u064E\u0646 \u0630\u0650\u0643\u06E1\u0631\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u064A\u064E\u0633\u06E1\u0644\u064F\u0643\u06E1\u0647\u064F \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0635\u064E\u0639\u064E\u062F\u0657\u0627" }, { id: 18, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0670\u062C\u0650\u062F\u064E \u0644\u0650\u0644\u0651\u064E\u0647\u0650 \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0645\u064E\u0639\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 19, text: "\u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0645\u0651\u064E\u0627 \u0642\u064E\u0627\u0645\u064E \u0639\u064E\u0628\u06E1\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0647\u064F \u0643\u064E\u0627\u062F\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u064F\u0648\u0646\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0644\u0650\u0628\u064E\u062F\u0657\u0627" }, { id: 20, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u0650\u064A \u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064F\u0634\u06E1\u0631\u0650\u0643\u064F \u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u062D\u064E\u062F\u0657\u0627" }, { id: 21, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0644\u064E\u0643\u064F\u0645\u06E1 \u0636\u064E\u0631\u0651\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0631\u064E\u0634\u064E\u062F\u0657\u0627" }, { id: 22, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u0651\u0650\u064A \u0644\u064E\u0646 \u064A\u064F\u062C\u0650\u064A\u0631\u064E\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u062D\u064E\u062F\u065E \u0648\u064E\u0644\u064E\u0646\u06E1 \u0623\u064E\u062C\u0650\u062F\u064E \u0645\u0650\u0646 \u062F\u064F\u0648\u0646\u0650\u0647\u0650\u06E6 \u0645\u064F\u0644\u06E1\u062A\u064E\u062D\u064E\u062F\u064B\u0627" }, { id: 23, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0628\u064E\u0644\u064E\u0670\u063A\u0657\u0627 \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0631\u0650\u0633\u064E\u0670\u0644\u064E\u0670\u062A\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0635\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0648\u064E\u0631\u064E\u0633\u064F\u0648\u0644\u064E\u0647\u064F\u06E5 \u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0647\u064F\u06E5 \u0646\u064E\u0627\u0631\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u064B\u0627" }, { id: 24, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0627\u0652 \u0645\u064E\u0627 \u064A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E \u0641\u064E\u0633\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0646\u06E1 \u0623\u064E\u0636\u06E1\u0639\u064E\u0641\u064F \u0646\u064E\u0627\u0635\u0650\u0631\u0657\u0627 \u0648\u064E\u0623\u064E\u0642\u064E\u0644\u0651\u064F \u0639\u064E\u062F\u064E\u062F\u0657\u0627" }, { id: 25, text: "\u0642\u064F\u0644\u06E1 \u0625\u0650\u0646\u06E1 \u0623\u064E\u062F\u06E1\u0631\u0650\u064A\u0653 \u0623\u064E\u0642\u064E\u0631\u0650\u064A\u0628\u065E \u0645\u0651\u064E\u0627 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E \u0623\u064E\u0645\u06E1 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0644\u064E\u0647\u064F\u06E5 \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u0645\u064E\u062F\u064B\u0627" }, { id: 26, text: "\u0639\u064E\u0670\u0644\u0650\u0645\u064F \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0641\u064E\u0644\u064E\u0627 \u064A\u064F\u0638\u06E1\u0647\u0650\u0631\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u063A\u064E\u064A\u06E1\u0628\u0650\u0647\u0650\u06E6\u0653 \u0623\u064E\u062D\u064E\u062F\u064B\u0627" }, { id: 27, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u0650 \u0671\u0631\u06E1\u062A\u064E\u0636\u064E\u0649\u0670 \u0645\u0650\u0646 \u0631\u0651\u064E\u0633\u064F\u0648\u0644\u0656 \u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0633\u06E1\u0644\u064F\u0643\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650 \u064A\u064E\u062F\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0645\u0650\u0646\u06E1 \u062E\u064E\u0644\u06E1\u0641\u0650\u0647\u0650\u06E6 \u0631\u064E\u0635\u064E\u062F\u0657\u0627" }, { id: 28, text: "\u0644\u0651\u0650\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064E \u0623\u064E\u0646 \u0642\u064E\u062F\u06E1 \u0623\u064E\u0628\u06E1\u0644\u064E\u063A\u064F\u0648\u0627\u0652 \u0631\u0650\u0633\u064E\u0670\u0644\u064E\u0670\u062A\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u062D\u064E\u0627\u0637\u064E \u0628\u0650\u0645\u064E\u0627 \u0644\u064E\u062F\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u064E\u0623\u064E\u062D\u06E1\u0635\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D \u0639\u064E\u062F\u064E\u062F\u064E\u06E2\u0627" }] }, { id: 73, name: "\u0627\u0644\u0645\u0632\u0645\u0644", transliteration: "Al-Muzzammil", type: "meccan", total_verses: 20, verses: [{ id: 1, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0632\u0651\u064E\u0645\u0651\u0650\u0644\u064F" }, { id: 2, text: "\u0642\u064F\u0645\u0650 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 3, text: "\u0646\u0651\u0650\u0635\u06E1\u0641\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u0648\u0650 \u0671\u0646\u0642\u064F\u0635\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064F \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627" }, { id: 4, text: "\u0623\u064E\u0648\u06E1 \u0632\u0650\u062F\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0648\u064E\u0631\u064E\u062A\u0651\u0650\u0644\u0650 \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u062A\u064E\u0631\u06E1\u062A\u0650\u064A\u0644\u064B\u0627" }, { id: 5, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0633\u064E\u0646\u064F\u0644\u06E1\u0642\u0650\u064A \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0642\u064E\u0648\u06E1\u0644\u0657\u0627 \u062B\u064E\u0642\u0650\u064A\u0644\u064B\u0627" }, { id: 6, text: "\u0625\u0650\u0646\u0651\u064E \u0646\u064E\u0627\u0634\u0650\u0626\u064E\u0629\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0647\u0650\u064A\u064E \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u0648\u064E\u0637\u06E1\u0640\u0654\u0657\u0627 \u0648\u064E\u0623\u064E\u0642\u06E1\u0648\u064E\u0645\u064F \u0642\u0650\u064A\u0644\u064B\u0627" }, { id: 7, text: "\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0643\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0633\u064E\u0628\u06E1\u062D\u0657\u0627 \u0637\u064E\u0648\u0650\u064A\u0644\u0657\u0627" }, { id: 8, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u0650 \u0671\u0633\u06E1\u0645\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0648\u064E\u062A\u064E\u0628\u064E\u062A\u0651\u064E\u0644\u06E1 \u0625\u0650\u0644\u064E\u064A\u06E1\u0647\u0650 \u062A\u064E\u0628\u06E1\u062A\u0650\u064A\u0644\u0657\u0627" }, { id: 9, text: "\u0631\u0651\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0631\u0650\u0642\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0631\u0650\u0628\u0650 \u0644\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0670\u0647\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E \u0641\u064E\u0671\u062A\u0651\u064E\u062E\u0650\u0630\u06E1\u0647\u064F \u0648\u064E\u0643\u0650\u064A\u0644\u0657\u0627" }, { id: 10, text: "\u0648\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0648\u064E\u0671\u0647\u06E1\u062C\u064F\u0631\u06E1\u0647\u064F\u0645\u06E1 \u0647\u064E\u062C\u06E1\u0631\u0657\u0627 \u062C\u064E\u0645\u0650\u064A\u0644\u0657\u0627" }, { id: 11, text: "\u0648\u064E\u0630\u064E\u0631\u06E1\u0646\u0650\u064A \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u0652\u0644\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0639\u06E1\u0645\u064E\u0629\u0650 \u0648\u064E\u0645\u064E\u0647\u0651\u0650\u0644\u06E1\u0647\u064F\u0645\u06E1 \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627" }, { id: 12, text: "\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0646\u0643\u064E\u0627\u0644\u0657\u0627 \u0648\u064E\u062C\u064E\u062D\u0650\u064A\u0645\u0657\u0627" }, { id: 13, text: "\u0648\u064E\u0637\u064E\u0639\u064E\u0627\u0645\u0657\u0627 \u0630\u064E\u0627 \u063A\u064F\u0635\u0651\u064E\u0629\u0656 \u0648\u064E\u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u0657\u0627" }, { id: 14, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0631\u06E1\u062C\u064F\u0641\u064F \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0648\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0643\u064E\u062B\u0650\u064A\u0628\u0657\u0627 \u0645\u0651\u064E\u0647\u0650\u064A\u0644\u064B\u0627" }, { id: 15, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627 \u0634\u064E\u0670\u0647\u0650\u062F\u064B\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0643\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0631\u064E\u0633\u064F\u0648\u0644\u0657\u0627" }, { id: 16, text: "\u0641\u064E\u0639\u064E\u0635\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064F \u0671\u0644\u0631\u0651\u064E\u0633\u064F\u0648\u0644\u064E \u0641\u064E\u0623\u064E\u062E\u064E\u0630\u06E1\u0646\u064E\u0670\u0647\u064F \u0623\u064E\u062E\u06E1\u0630\u0657\u0627 \u0648\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 17, text: "\u0641\u064E\u0643\u064E\u064A\u06E1\u0641\u064E \u062A\u064E\u062A\u0651\u064E\u0642\u064F\u0648\u0646\u064E \u0625\u0650\u0646 \u0643\u064E\u0641\u064E\u0631\u06E1\u062A\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u0657\u0627 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u064F \u0671\u0644\u06E1\u0648\u0650\u0644\u06E1\u062F\u064E\u0670\u0646\u064E \u0634\u0650\u064A\u0628\u064B\u0627" }, { id: 18, text: "\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0645\u064F\u0646\u0641\u064E\u0637\u0650\u0631\u064F\u06E2 \u0628\u0650\u0647\u0650\u06E6\u06DA \u0643\u064E\u0627\u0646\u064E \u0648\u064E\u0639\u06E1\u062F\u064F\u0647\u064F\u06E5 \u0645\u064E\u0641\u06E1\u0639\u064F\u0648\u0644\u064B\u0627" }, { id: 19, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u062A\u064E\u0630\u06E1\u0643\u0650\u0631\u064E\u0629\u065E\u06D6 \u0641\u064E\u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0633\u064E\u0628\u0650\u064A\u0644\u064B\u0627" }, { id: 20, text: "\u06DE\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0623\u064E\u0646\u0651\u064E\u0643\u064E \u062A\u064E\u0642\u064F\u0648\u0645\u064F \u0623\u064E\u062F\u06E1\u0646\u064E\u0649\u0670 \u0645\u0650\u0646 \u062B\u064F\u0644\u064F\u062B\u064E\u064A\u0650 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0646\u0650\u0635\u06E1\u0641\u064E\u0647\u064F\u06E5 \u0648\u064E\u062B\u064F\u0644\u064F\u062B\u064E\u0647\u064F\u06E5 \u0648\u064E\u0637\u064E\u0627\u0653\u0626\u0650\u0641\u064E\u0629\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0645\u064E\u0639\u064E\u0643\u064E\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u064A\u064F\u0642\u064E\u062F\u0651\u0650\u0631\u064F \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E\u06DA \u0639\u064E\u0644\u0650\u0645\u064E \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u062A\u064F\u062D\u06E1\u0635\u064F\u0648\u0647\u064F \u0641\u064E\u062A\u064E\u0627\u0628\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1\u06D6 \u0641\u064E\u0671\u0642\u06E1\u0631\u064E\u0621\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u062A\u064E\u064A\u064E\u0633\u0651\u064E\u0631\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u0650\u06DA \u0639\u064E\u0644\u0650\u0645\u064E \u0623\u064E\u0646 \u0633\u064E\u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0645\u0650\u0646\u0643\u064F\u0645 \u0645\u0651\u064E\u0631\u06E1\u0636\u064E\u0649\u0670 \u0648\u064E\u0621\u064E\u0627\u062E\u064E\u0631\u064F\u0648\u0646\u064E \u064A\u064E\u0636\u06E1\u0631\u0650\u0628\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u064A\u064E\u0628\u06E1\u062A\u064E\u063A\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0641\u064E\u0636\u06E1\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0621\u064E\u0627\u062E\u064E\u0631\u064F\u0648\u0646\u064E \u064A\u064F\u0642\u064E\u0670\u062A\u0650\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0633\u064E\u0628\u0650\u064A\u0644\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650\u06D6 \u0641\u064E\u0671\u0642\u06E1\u0631\u064E\u0621\u064F\u0648\u0627\u0652 \u0645\u064E\u0627 \u062A\u064E\u064A\u064E\u0633\u0651\u064E\u0631\u064E \u0645\u0650\u0646\u06E1\u0647\u064F\u06DA \u0648\u064E\u0623\u064E\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0621\u064E\u0627\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u0623\u064E\u0642\u06E1\u0631\u0650\u0636\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0642\u064E\u0631\u06E1\u0636\u064B\u0627 \u062D\u064E\u0633\u064E\u0646\u0657\u0627\u06DA \u0648\u064E\u0645\u064E\u0627 \u062A\u064F\u0642\u064E\u062F\u0651\u0650\u0645\u064F\u0648\u0627\u0652 \u0644\u0650\u0623\u064E\u0646\u0641\u064F\u0633\u0650\u0643\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u064A\u06E1\u0631\u0656 \u062A\u064E\u062C\u0650\u062F\u064F\u0648\u0647\u064F \u0639\u0650\u0646\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0647\u064F\u0648\u064E \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u0648\u064E\u0623\u064E\u0639\u06E1\u0638\u064E\u0645\u064E \u0623\u064E\u062C\u06E1\u0631\u0657\u0627\u06DA \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u06D6 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u063A\u064E\u0641\u064F\u0648\u0631\u065E \u0631\u0651\u064E\u062D\u0650\u064A\u0645\u064F\u06E2" }] }, { id: 74, name: "\u0627\u0644\u0645\u062F\u062B\u0631", transliteration: "Al-Muddaththir", type: "meccan", total_verses: 56, verses: [{ id: 1, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u062F\u0651\u064E\u062B\u0651\u0650\u0631\u064F" }, { id: 2, text: "\u0642\u064F\u0645\u06E1 \u0641\u064E\u0623\u064E\u0646\u0630\u0650\u0631\u06E1" }, { id: 3, text: "\u0648\u064E\u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0641\u064E\u0643\u064E\u0628\u0651\u0650\u0631\u06E1" }, { id: 4, text: "\u0648\u064E\u062B\u0650\u064A\u064E\u0627\u0628\u064E\u0643\u064E \u0641\u064E\u0637\u064E\u0647\u0651\u0650\u0631\u06E1" }, { id: 5, text: "\u0648\u064E\u0671\u0644\u0631\u0651\u064F\u062C\u06E1\u0632\u064E \u0641\u064E\u0671\u0647\u06E1\u062C\u064F\u0631\u06E1" }, { id: 6, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0645\u06E1\u0646\u064F\u0646 \u062A\u064E\u0633\u06E1\u062A\u064E\u0643\u06E1\u062B\u0650\u0631\u064F" }, { id: 7, text: "\u0648\u064E\u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1" }, { id: 8, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0646\u064F\u0642\u0650\u0631\u064E \u0641\u0650\u064A \u0671\u0644\u0646\u0651\u064E\u0627\u0642\u064F\u0648\u0631\u0650" }, { id: 9, text: "\u0641\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064E\u0648\u06E1\u0645\u064C \u0639\u064E\u0633\u0650\u064A\u0631\u064C" }, { id: 10, text: "\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u063A\u064E\u064A\u06E1\u0631\u064F \u064A\u064E\u0633\u0650\u064A\u0631\u0656" }, { id: 11, text: "\u0630\u064E\u0631\u06E1\u0646\u0650\u064A \u0648\u064E\u0645\u064E\u0646\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u062A\u064F \u0648\u064E\u062D\u0650\u064A\u062F\u0657\u0627" }, { id: 12, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u062A\u064F \u0644\u064E\u0647\u064F\u06E5 \u0645\u064E\u0627\u0644\u0657\u0627 \u0645\u0651\u064E\u0645\u06E1\u062F\u064F\u0648\u062F\u0657\u0627" }, { id: 13, text: "\u0648\u064E\u0628\u064E\u0646\u0650\u064A\u0646\u064E \u0634\u064F\u0647\u064F\u0648\u062F\u0657\u0627" }, { id: 14, text: "\u0648\u064E\u0645\u064E\u0647\u0651\u064E\u062F\u062A\u0651\u064F \u0644\u064E\u0647\u064F\u06E5 \u062A\u064E\u0645\u06E1\u0647\u0650\u064A\u062F\u0657\u0627" }, { id: 15, text: "\u062B\u064F\u0645\u0651\u064E \u064A\u064E\u0637\u06E1\u0645\u064E\u0639\u064F \u0623\u064E\u0646\u06E1 \u0623\u064E\u0632\u0650\u064A\u062F\u064E" }, { id: 16, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653\u06D6 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0644\u0650\u0623\u0653\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0639\u064E\u0646\u0650\u064A\u062F\u0657\u0627" }, { id: 17, text: "\u0633\u064E\u0623\u064F\u0631\u06E1\u0647\u0650\u0642\u064F\u0647\u064F\u06E5 \u0635\u064E\u0639\u064F\u0648\u062F\u064B\u0627" }, { id: 18, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0641\u064E\u0643\u0651\u064E\u0631\u064E \u0648\u064E\u0642\u064E\u062F\u0651\u064E\u0631\u064E" }, { id: 19, text: "\u0641\u064E\u0642\u064F\u062A\u0650\u0644\u064E \u0643\u064E\u064A\u06E1\u0641\u064E \u0642\u064E\u062F\u0651\u064E\u0631\u064E" }, { id: 20, text: "\u062B\u064F\u0645\u0651\u064E \u0642\u064F\u062A\u0650\u0644\u064E \u0643\u064E\u064A\u06E1\u0641\u064E \u0642\u064E\u062F\u0651\u064E\u0631\u064E" }, { id: 21, text: "\u062B\u064F\u0645\u0651\u064E \u0646\u064E\u0638\u064E\u0631\u064E" }, { id: 22, text: "\u062B\u064F\u0645\u0651\u064E \u0639\u064E\u0628\u064E\u0633\u064E \u0648\u064E\u0628\u064E\u0633\u064E\u0631\u064E" }, { id: 23, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062F\u06E1\u0628\u064E\u0631\u064E \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u0643\u06E1\u0628\u064E\u0631\u064E" }, { id: 24, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0633\u0650\u062D\u06E1\u0631\u065E \u064A\u064F\u0624\u06E1\u062B\u064E\u0631\u064F" }, { id: 25, text: "\u0625\u0650\u0646\u06E1 \u0647\u064E\u0670\u0630\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0642\u064E\u0648\u06E1\u0644\u064F \u0671\u0644\u06E1\u0628\u064E\u0634\u064E\u0631\u0650" }, { id: 26, text: "\u0633\u064E\u0623\u064F\u0635\u06E1\u0644\u0650\u064A\u0647\u0650 \u0633\u064E\u0642\u064E\u0631\u064E" }, { id: 27, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u0633\u064E\u0642\u064E\u0631\u064F" }, { id: 28, text: "\u0644\u064E\u0627 \u062A\u064F\u0628\u06E1\u0642\u0650\u064A \u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u0630\u064E\u0631\u064F" }, { id: 29, text: "\u0644\u064E\u0648\u0651\u064E\u0627\u062D\u064E\u0629\u065E \u0644\u0651\u0650\u0644\u06E1\u0628\u064E\u0634\u064E\u0631\u0650" }, { id: 30, text: "\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u062A\u0650\u0633\u06E1\u0639\u064E\u0629\u064E \u0639\u064E\u0634\u064E\u0631\u064E" }, { id: 31, text: "\u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u0657\u06D6 \u0648\u064E\u0645\u064E\u0627 \u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u0650\u062F\u0651\u064E\u062A\u064E\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0641\u0650\u062A\u06E1\u0646\u064E\u0629\u0657 \u0644\u0651\u0650\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0644\u0650\u064A\u064E\u0633\u06E1\u062A\u064E\u064A\u06E1\u0642\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u064A\u064E\u0632\u06E1\u062F\u064E\u0627\u062F\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u064A\u0645\u064E\u0670\u0646\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062A\u064E\u0627\u0628\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E \u0648\u064E\u0644\u0650\u064A\u064E\u0642\u064F\u0648\u0644\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0631\u064E\u0636\u065E \u0648\u064E\u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0630\u064E\u0627\u0653 \u0623\u064E\u0631\u064E\u0627\u062F\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0645\u064E\u062B\u064E\u0644\u0657\u0627\u06DA \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u064A\u064F\u0636\u0650\u0644\u0651\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0648\u064E\u064A\u064E\u0647\u06E1\u062F\u0650\u064A \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u06DA \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u062C\u064F\u0646\u064F\u0648\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0647\u064F\u0648\u064E\u06DA \u0648\u064E\u0645\u064E\u0627 \u0647\u0650\u064A\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670 \u0644\u0650\u0644\u06E1\u0628\u064E\u0634\u064E\u0631\u0650" }, { id: 32, text: "\u0643\u064E\u0644\u0651\u064E\u0627 \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u0650" }, { id: 33, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0625\u0650\u0630\u06E1 \u0623\u064E\u062F\u06E1\u0628\u064E\u0631\u064E" }, { id: 34, text: "\u0648\u064E\u0671\u0644\u0635\u0651\u064F\u0628\u06E1\u062D\u0650 \u0625\u0650\u0630\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0641\u064E\u0631\u064E" }, { id: 35, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0644\u064E\u0625\u0650\u062D\u06E1\u062F\u064E\u0649 \u0671\u0644\u06E1\u0643\u064F\u0628\u064E\u0631\u0650" }, { id: 36, text: "\u0646\u064E\u0630\u0650\u064A\u0631\u0657\u0627 \u0644\u0651\u0650\u0644\u06E1\u0628\u064E\u0634\u064E\u0631\u0650" }, { id: 37, text: "\u0644\u0650\u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u062A\u064E\u0642\u064E\u062F\u0651\u064E\u0645\u064E \u0623\u064E\u0648\u06E1 \u064A\u064E\u062A\u064E\u0623\u064E\u062E\u0651\u064E\u0631\u064E" }, { id: 38, text: "\u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E\u062A\u06E1 \u0631\u064E\u0647\u0650\u064A\u0646\u064E\u0629\u064C" }, { id: 39, text: "\u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064E \u0671\u0644\u06E1\u064A\u064E\u0645\u0650\u064A\u0646\u0650" }, { id: 40, text: "\u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u0656 \u064A\u064E\u062A\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 41, text: "\u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 42, text: "\u0645\u064E\u0627 \u0633\u064E\u0644\u064E\u0643\u064E\u0643\u064F\u0645\u06E1 \u0641\u0650\u064A \u0633\u064E\u0642\u064E\u0631\u064E" }, { id: 43, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0644\u064E\u0645\u06E1 \u0646\u064E\u0643\u064F \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0635\u064E\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 44, text: "\u0648\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u0643\u064F \u0646\u064F\u0637\u06E1\u0639\u0650\u0645\u064F \u0671\u0644\u06E1\u0645\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064E\u062E\u064F\u0648\u0636\u064F \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u062E\u064E\u0627\u0653\u0626\u0650\u0636\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0648\u064E\u0643\u064F\u0646\u0651\u064E\u0627 \u0646\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F \u0628\u0650\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 47, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670\u0653 \u0623\u064E\u062A\u064E\u0649\u0670\u0646\u064E\u0627 \u0671\u0644\u06E1\u064A\u064E\u0642\u0650\u064A\u0646\u064F" }, { id: 48, text: "\u0641\u064E\u0645\u064E\u0627 \u062A\u064E\u0646\u0641\u064E\u0639\u064F\u0647\u064F\u0645\u06E1 \u0634\u064E\u0641\u064E\u0670\u0639\u064E\u0629\u064F \u0671\u0644\u0634\u0651\u064E\u0640\u0670\u0641\u0650\u0639\u0650\u064A\u0646\u064E" }, { id: 49, text: "\u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u0650 \u0671\u0644\u062A\u0651\u064E\u0630\u06E1\u0643\u0650\u0631\u064E\u0629\u0650 \u0645\u064F\u0639\u06E1\u0631\u0650\u0636\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u062D\u064F\u0645\u064F\u0631\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0646\u0641\u0650\u0631\u064E\u0629\u065E" }, { id: 51, text: "\u0641\u064E\u0631\u0651\u064E\u062A\u06E1 \u0645\u0650\u0646 \u0642\u064E\u0633\u06E1\u0648\u064E\u0631\u064E\u0629\u0650\u06ED" }, { id: 52, text: "\u0628\u064E\u0644\u06E1 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0643\u064F\u0644\u0651\u064F \u0671\u0645\u06E1\u0631\u0650\u064A\u0655\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064F\u0624\u06E1\u062A\u064E\u0649\u0670 \u0635\u064F\u062D\u064F\u0641\u0657\u0627 \u0645\u0651\u064F\u0646\u064E\u0634\u0651\u064E\u0631\u064E\u0629\u0657" }, { id: 53, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u06D6 \u0628\u064E\u0644 \u0644\u0651\u064E\u0627 \u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E" }, { id: 54, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u062A\u064E\u0630\u06E1\u0643\u0650\u0631\u064E\u0629\u065E" }, { id: 55, text: "\u0641\u064E\u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0630\u064E\u0643\u064E\u0631\u064E\u0647\u064F\u06E5" }, { id: 56, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u0630\u06E1\u0643\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0647\u064F\u0648\u064E \u0623\u064E\u0647\u06E1\u0644\u064F \u0671\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670 \u0648\u064E\u0623\u064E\u0647\u06E1\u0644\u064F \u0671\u0644\u06E1\u0645\u064E\u063A\u06E1\u0641\u0650\u0631\u064E\u0629\u0650" }] }, { id: 75, name: "\u0627\u0644\u0642\u064A\u0627\u0645\u0629", transliteration: "Al-Qiyamah", type: "meccan", total_verses: 40, verses: [{ id: 1, text: "\u0644\u064E\u0627\u0653 \u0623\u064F\u0642\u06E1\u0633\u0650\u0645\u064F \u0628\u0650\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650" }, { id: 2, text: "\u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064F\u0642\u06E1\u0633\u0650\u0645\u064F \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0641\u06E1\u0633\u0650 \u0671\u0644\u0644\u0651\u064E\u0648\u0651\u064E\u0627\u0645\u064E\u0629\u0650" }, { id: 3, text: "\u0623\u064E\u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0623\u064E\u0644\u0651\u064E\u0646 \u0646\u0651\u064E\u062C\u06E1\u0645\u064E\u0639\u064E \u0639\u0650\u0638\u064E\u0627\u0645\u064E\u0647\u064F\u06E5" }, { id: 4, text: "\u0628\u064E\u0644\u064E\u0649\u0670 \u0642\u064E\u0670\u062F\u0650\u0631\u0650\u064A\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u0646\u0651\u064F\u0633\u064E\u0648\u0651\u0650\u064A\u064E \u0628\u064E\u0646\u064E\u0627\u0646\u064E\u0647\u064F\u06E5" }, { id: 5, text: "\u0628\u064E\u0644\u06E1 \u064A\u064F\u0631\u0650\u064A\u062F\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0644\u0650\u064A\u064E\u0641\u06E1\u062C\u064F\u0631\u064E \u0623\u064E\u0645\u064E\u0627\u0645\u064E\u0647\u064F\u06E5" }, { id: 6, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F \u0623\u064E\u064A\u0651\u064E\u0627\u0646\u064E \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u0645\u064E\u0629\u0650" }, { id: 7, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0631\u0650\u0642\u064E \u0671\u0644\u06E1\u0628\u064E\u0635\u064E\u0631\u064F" }, { id: 8, text: "\u0648\u064E\u062E\u064E\u0633\u064E\u0641\u064E \u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064F" }, { id: 9, text: "\u0648\u064E\u062C\u064F\u0645\u0650\u0639\u064E \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064F \u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u064F" }, { id: 10, text: "\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u0623\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0641\u064E\u0631\u0651\u064F" }, { id: 11, text: "\u0643\u064E\u0644\u0651\u064E\u0627 \u0644\u064E\u0627 \u0648\u064E\u0632\u064E\u0631\u064E" }, { id: 12, text: "\u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u0671\u0644\u06E1\u0645\u064F\u0633\u06E1\u062A\u064E\u0642\u064E\u0631\u0651\u064F" }, { id: 13, text: "\u064A\u064F\u0646\u064E\u0628\u0651\u064E\u0624\u064F\u0627\u0652 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0650\u06ED \u0628\u0650\u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E \u0648\u064E\u0623\u064E\u062E\u0651\u064E\u0631\u064E" }, { id: 14, text: "\u0628\u064E\u0644\u0650 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0646\u064E\u0641\u06E1\u0633\u0650\u0647\u0650\u06E6 \u0628\u064E\u0635\u0650\u064A\u0631\u064E\u0629\u065E" }, { id: 15, text: "\u0648\u064E\u0644\u064E\u0648\u06E1 \u0623\u064E\u0644\u06E1\u0642\u064E\u0649\u0670 \u0645\u064E\u0639\u064E\u0627\u0630\u0650\u064A\u0631\u064E\u0647\u064F\u06E5" }, { id: 16, text: "\u0644\u064E\u0627 \u062A\u064F\u062D\u064E\u0631\u0651\u0650\u0643\u06E1 \u0628\u0650\u0647\u0650\u06E6 \u0644\u0650\u0633\u064E\u0627\u0646\u064E\u0643\u064E \u0644\u0650\u062A\u064E\u0639\u06E1\u062C\u064E\u0644\u064E \u0628\u0650\u0647\u0650\u06E6\u0653" }, { id: 17, text: "\u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u062C\u064E\u0645\u06E1\u0639\u064E\u0647\u064F\u06E5 \u0648\u064E\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E\u0647\u064F\u06E5" }, { id: 18, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064E\u0631\u064E\u0623\u06E1\u0646\u064E\u0670\u0647\u064F \u0641\u064E\u0671\u062A\u0651\u064E\u0628\u0650\u0639\u06E1 \u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E\u0647\u064F\u06E5" }, { id: 19, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0628\u064E\u064A\u064E\u0627\u0646\u064E\u0647\u064F\u06E5" }, { id: 20, text: "\u0643\u064E\u0644\u0651\u064E\u0627 \u0628\u064E\u0644\u06E1 \u062A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0627\u062C\u0650\u0644\u064E\u0629\u064E" }, { id: 21, text: "\u0648\u064E\u062A\u064E\u0630\u064E\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E" }, { id: 22, text: "\u0648\u064F\u062C\u064F\u0648\u0647\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0646\u0651\u064E\u0627\u0636\u0650\u0631\u064E\u0629\u064C" }, { id: 23, text: "\u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u064E\u0627 \u0646\u064E\u0627\u0638\u0650\u0631\u064E\u0629\u065E" }, { id: 24, text: "\u0648\u064E\u0648\u064F\u062C\u064F\u0648\u0647\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0650\u06ED \u0628\u064E\u0627\u0633\u0650\u0631\u064E\u0629\u065E" }, { id: 25, text: "\u062A\u064E\u0638\u064F\u0646\u0651\u064F \u0623\u064E\u0646 \u064A\u064F\u0641\u06E1\u0639\u064E\u0644\u064E \u0628\u0650\u0647\u064E\u0627 \u0641\u064E\u0627\u0642\u0650\u0631\u064E\u0629\u065E" }, { id: 26, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0630\u064E\u0627 \u0628\u064E\u0644\u064E\u063A\u064E\u062A\u0650 \u0671\u0644\u062A\u0651\u064E\u0631\u064E\u0627\u0642\u0650\u064A\u064E" }, { id: 27, text: "\u0648\u064E\u0642\u0650\u064A\u0644\u064E \u0645\u064E\u0646\u06E1\u06DC \u0631\u064E\u0627\u0642\u0656" }, { id: 28, text: "\u0648\u064E\u0638\u064E\u0646\u0651\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0641\u0650\u0631\u064E\u0627\u0642\u064F" }, { id: 29, text: "\u0648\u064E\u0671\u0644\u06E1\u062A\u064E\u0641\u0651\u064E\u062A\u0650 \u0671\u0644\u0633\u0651\u064E\u0627\u0642\u064F \u0628\u0650\u0671\u0644\u0633\u0651\u064E\u0627\u0642\u0650" }, { id: 30, text: "\u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u0671\u0644\u06E1\u0645\u064E\u0633\u064E\u0627\u0642\u064F" }, { id: 31, text: "\u0641\u064E\u0644\u064E\u0627 \u0635\u064E\u062F\u0651\u064E\u0642\u064E \u0648\u064E\u0644\u064E\u0627 \u0635\u064E\u0644\u0651\u064E\u0649\u0670" }, { id: 32, text: "\u0648\u064E\u0644\u064E\u0670\u0643\u0650\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0648\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670" }, { id: 33, text: "\u062B\u064F\u0645\u0651\u064E \u0630\u064E\u0647\u064E\u0628\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6 \u064A\u064E\u062A\u064E\u0645\u064E\u0637\u0651\u064E\u0649\u0670\u0653" }, { id: 34, text: "\u0623\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0644\u064E\u0643\u064E \u0641\u064E\u0623\u064E\u0648\u06E1\u0644\u064E\u0649\u0670" }, { id: 35, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0648\u06E1\u0644\u064E\u0649\u0670 \u0644\u064E\u0643\u064E \u0641\u064E\u0623\u064E\u0648\u06E1\u0644\u064E\u0649\u0670\u0653" }, { id: 36, text: "\u0623\u064E\u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0623\u064E\u0646 \u064A\u064F\u062A\u06E1\u0631\u064E\u0643\u064E \u0633\u064F\u062F\u064B\u0649" }, { id: 37, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F \u0646\u064F\u0637\u06E1\u0641\u064E\u0629\u0657 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0646\u0650\u064A\u0651\u0656 \u064A\u064F\u0645\u06E1\u0646\u064E\u0649\u0670" }, { id: 38, text: "\u062B\u064F\u0645\u0651\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0642\u064E\u0629\u0657 \u0641\u064E\u062E\u064E\u0644\u064E\u0642\u064E \u0641\u064E\u0633\u064E\u0648\u0651\u064E\u0649\u0670" }, { id: 39, text: "\u0641\u064E\u062C\u064E\u0639\u064E\u0644\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u0671\u0644\u0632\u0651\u064E\u0648\u06E1\u062C\u064E\u064A\u06E1\u0646\u0650 \u0671\u0644\u0630\u0651\u064E\u0643\u064E\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u0649\u0670\u0653" }, { id: 40, text: "\u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0628\u0650\u0642\u064E\u0670\u062F\u0650\u0631\u064D \u0639\u064E\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u064A\u064F\u062D\u06E1\u0640\u06E7\u0650\u064A\u064E \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u062A\u064E\u0649\u0670" }] }, { id: 76, name: "\u0627\u0644\u0627\u0646\u0633\u0627\u0646", transliteration: "Al-Insan", type: "medinan", total_verses: 31, verses: [{ id: 1, text: "\u0647\u064E\u0644\u06E1 \u0623\u064E\u062A\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u0650 \u062D\u0650\u064A\u0646\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u062F\u0651\u064E\u0647\u06E1\u0631\u0650 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627 \u0645\u0651\u064E\u0630\u06E1\u0643\u064F\u0648\u0631\u064B\u0627" }, { id: 2, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0645\u0650\u0646 \u0646\u0651\u064F\u0637\u06E1\u0641\u064E\u0629\u064D \u0623\u064E\u0645\u06E1\u0634\u064E\u0627\u062C\u0656 \u0646\u0651\u064E\u0628\u06E1\u062A\u064E\u0644\u0650\u064A\u0647\u0650 \u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0633\u064E\u0645\u0650\u064A\u0639\u064E\u06E2\u0627 \u0628\u064E\u0635\u0650\u064A\u0631\u064B\u0627" }, { id: 3, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0647\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u064E \u0625\u0650\u0645\u0651\u064E\u0627 \u0634\u064E\u0627\u0643\u0650\u0631\u0657\u0627 \u0648\u064E\u0625\u0650\u0645\u0651\u064E\u0627 \u0643\u064E\u0641\u064F\u0648\u0631\u064B\u0627" }, { id: 4, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u062A\u064E\u062F\u06E1\u0646\u064E\u0627 \u0644\u0650\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0633\u064E\u0644\u064E\u0670\u0633\u0650\u0644\u064E\u0627\u0652 \u0648\u064E\u0623\u064E\u063A\u06E1\u0644\u064E\u0670\u0644\u0657\u0627 \u0648\u064E\u0633\u064E\u0639\u0650\u064A\u0631\u064B\u0627" }, { id: 5, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0631\u064E\u0627\u0631\u064E \u064A\u064E\u0634\u06E1\u0631\u064E\u0628\u064F\u0648\u0646\u064E \u0645\u0650\u0646 \u0643\u064E\u0623\u06E1\u0633\u0656 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0632\u064E\u0627\u062C\u064F\u0647\u064E\u0627 \u0643\u064E\u0627\u0641\u064F\u0648\u0631\u064B\u0627" }, { id: 6, text: "\u0639\u064E\u064A\u06E1\u0646\u0657\u0627 \u064A\u064E\u0634\u06E1\u0631\u064E\u0628\u064F \u0628\u0650\u0647\u064E\u0627 \u0639\u0650\u0628\u064E\u0627\u062F\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064F\u0641\u064E\u062C\u0651\u0650\u0631\u064F\u0648\u0646\u064E\u0647\u064E\u0627 \u062A\u064E\u0641\u06E1\u062C\u0650\u064A\u0631\u0657\u0627" }, { id: 7, text: "\u064A\u064F\u0648\u0641\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0630\u06E1\u0631\u0650 \u0648\u064E\u064A\u064E\u062E\u064E\u0627\u0641\u064F\u0648\u0646\u064E \u064A\u064E\u0648\u06E1\u0645\u0657\u0627 \u0643\u064E\u0627\u0646\u064E \u0634\u064E\u0631\u0651\u064F\u0647\u064F\u06E5 \u0645\u064F\u0633\u06E1\u062A\u064E\u0637\u0650\u064A\u0631\u0657\u0627" }, { id: 8, text: "\u0648\u064E\u064A\u064F\u0637\u06E1\u0639\u0650\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u0637\u0651\u064E\u0639\u064E\u0627\u0645\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u062D\u064F\u0628\u0651\u0650\u0647\u0650\u06E6 \u0645\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u0657\u0627 \u0648\u064E\u064A\u064E\u062A\u0650\u064A\u0645\u0657\u0627 \u0648\u064E\u0623\u064E\u0633\u0650\u064A\u0631\u064B\u0627" }, { id: 9, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0646\u064F\u0637\u06E1\u0639\u0650\u0645\u064F\u0643\u064F\u0645\u06E1 \u0644\u0650\u0648\u064E\u062C\u06E1\u0647\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0644\u064E\u0627 \u0646\u064F\u0631\u0650\u064A\u062F\u064F \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u0644\u064E\u0627 \u0634\u064F\u0643\u064F\u0648\u0631\u064B\u0627" }, { id: 10, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u062E\u064E\u0627\u0641\u064F \u0645\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0646\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064B\u0627 \u0639\u064E\u0628\u064F\u0648\u0633\u0657\u0627 \u0642\u064E\u0645\u06E1\u0637\u064E\u0631\u0650\u064A\u0631\u0657\u0627" }, { id: 11, text: "\u0641\u064E\u0648\u064E\u0642\u064E\u0649\u0670\u0647\u064F\u0645\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0634\u064E\u0631\u0651\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0648\u064E\u0644\u064E\u0642\u0651\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0646\u064E\u0636\u06E1\u0631\u064E\u0629\u0657 \u0648\u064E\u0633\u064F\u0631\u064F\u0648\u0631\u0657\u0627" }, { id: 12, text: "\u0648\u064E\u062C\u064E\u0632\u064E\u0649\u0670\u0647\u064F\u0645 \u0628\u0650\u0645\u064E\u0627 \u0635\u064E\u0628\u064E\u0631\u064F\u0648\u0627\u0652 \u062C\u064E\u0646\u0651\u064E\u0629\u0657 \u0648\u064E\u062D\u064E\u0631\u0650\u064A\u0631\u0657\u0627" }, { id: 13, text: "\u0645\u0651\u064F\u062A\u0651\u064E\u0643\u0650\u0640\u0654\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0643\u0650\u06D6 \u0644\u064E\u0627 \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0634\u064E\u0645\u06E1\u0633\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0632\u064E\u0645\u06E1\u0647\u064E\u0631\u0650\u064A\u0631\u0657\u0627" }, { id: 14, text: "\u0648\u064E\u062F\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u064B \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0638\u0650\u0644\u064E\u0670\u0644\u064F\u0647\u064E\u0627 \u0648\u064E\u0630\u064F\u0644\u0651\u0650\u0644\u064E\u062A\u06E1 \u0642\u064F\u0637\u064F\u0648\u0641\u064F\u0647\u064E\u0627 \u062A\u064E\u0630\u06E1\u0644\u0650\u064A\u0644\u0657\u0627" }, { id: 15, text: "\u0648\u064E\u064A\u064F\u0637\u064E\u0627\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0640\u0654\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0641\u0650\u0636\u0651\u064E\u0629\u0656 \u0648\u064E\u0623\u064E\u0643\u06E1\u0648\u064E\u0627\u0628\u0656 \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0642\u064E\u0648\u064E\u0627\u0631\u0650\u064A\u0631\u064E\u0627\u06E0" }, { id: 16, text: "\u0642\u064E\u0648\u064E\u0627\u0631\u0650\u064A\u0631\u064E\u0627\u0652 \u0645\u0650\u0646 \u0641\u0650\u0636\u0651\u064E\u0629\u0656 \u0642\u064E\u062F\u0651\u064E\u0631\u064F\u0648\u0647\u064E\u0627 \u062A\u064E\u0642\u06E1\u062F\u0650\u064A\u0631\u0657\u0627" }, { id: 17, text: "\u0648\u064E\u064A\u064F\u0633\u06E1\u0642\u064E\u0648\u06E1\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0643\u064E\u0623\u06E1\u0633\u0657\u0627 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0632\u064E\u0627\u062C\u064F\u0647\u064E\u0627 \u0632\u064E\u0646\u062C\u064E\u0628\u0650\u064A\u0644\u064B\u0627" }, { id: 18, text: "\u0639\u064E\u064A\u06E1\u0646\u0657\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u062A\u064F\u0633\u064E\u0645\u0651\u064E\u0649\u0670 \u0633\u064E\u0644\u06E1\u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 19, text: "\u06DE\u0648\u064E\u064A\u064E\u0637\u064F\u0648\u0641\u064F \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0648\u0650\u0644\u06E1\u062F\u064E\u0670\u0646\u065E \u0645\u0651\u064F\u062E\u064E\u0644\u0651\u064E\u062F\u064F\u0648\u0646\u064E \u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u062D\u064E\u0633\u0650\u0628\u06E1\u062A\u064E\u0647\u064F\u0645\u06E1 \u0644\u064F\u0624\u06E1\u0644\u064F\u0624\u0657\u0627 \u0645\u0651\u064E\u0646\u062B\u064F\u0648\u0631\u0657\u0627" }, { id: 20, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E \u062B\u064E\u0645\u0651\u064E \u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E \u0646\u064E\u0639\u0650\u064A\u0645\u0657\u0627 \u0648\u064E\u0645\u064F\u0644\u06E1\u0643\u0657\u0627 \u0643\u064E\u0628\u0650\u064A\u0631\u064B\u0627" }, { id: 21, text: "\u0639\u064E\u0670\u0644\u0650\u064A\u064E\u0647\u064F\u0645\u06E1 \u062B\u0650\u064A\u064E\u0627\u0628\u064F \u0633\u064F\u0646\u062F\u064F\u0633\u064D \u062E\u064F\u0636\u06E1\u0631\u065E \u0648\u064E\u0625\u0650\u0633\u06E1\u062A\u064E\u0628\u06E1\u0631\u064E\u0642\u065E\u06D6 \u0648\u064E\u062D\u064F\u0644\u0651\u064F\u0648\u0653\u0627\u0652 \u0623\u064E\u0633\u064E\u0627\u0648\u0650\u0631\u064E \u0645\u0650\u0646 \u0641\u0650\u0636\u0651\u064E\u0629\u0656 \u0648\u064E\u0633\u064E\u0642\u064E\u0649\u0670\u0647\u064F\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645\u06E1 \u0634\u064E\u0631\u064E\u0627\u0628\u0657\u0627 \u0637\u064E\u0647\u064F\u0648\u0631\u064B\u0627" }, { id: 22, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u062C\u064E\u0632\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u0643\u064E\u0627\u0646\u064E \u0633\u064E\u0639\u06E1\u064A\u064F\u0643\u064F\u0645 \u0645\u0651\u064E\u0634\u06E1\u0643\u064F\u0648\u0631\u064B\u0627" }, { id: 23, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0646\u064E\u062D\u06E1\u0646\u064F \u0646\u064E\u0632\u0651\u064E\u0644\u06E1\u0646\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064E \u062A\u064E\u0646\u0632\u0650\u064A\u0644\u0657\u0627" }, { id: 24, text: "\u0641\u064E\u0671\u0635\u06E1\u0628\u0650\u0631\u06E1 \u0644\u0650\u062D\u064F\u0643\u06E1\u0645\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0648\u064E\u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u0639\u06E1 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0621\u064E\u0627\u062B\u0650\u0645\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0643\u064E\u0641\u064F\u0648\u0631\u0657\u0627" }, { id: 25, text: "\u0648\u064E\u0671\u0630\u06E1\u0643\u064F\u0631\u0650 \u0671\u0633\u06E1\u0645\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0628\u064F\u0643\u06E1\u0631\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0635\u0650\u064A\u0644\u0657\u0627" }, { id: 26, text: "\u0648\u064E\u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0641\u064E\u0671\u0633\u06E1\u062C\u064F\u062F\u06E1 \u0644\u064E\u0647\u064F\u06E5 \u0648\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1\u0647\u064F \u0644\u064E\u064A\u06E1\u0644\u0657\u0627 \u0637\u064E\u0648\u0650\u064A\u0644\u064B\u0627" }, { id: 27, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u064A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0639\u064E\u0627\u062C\u0650\u0644\u064E\u0629\u064E \u0648\u064E\u064A\u064E\u0630\u064E\u0631\u064F\u0648\u0646\u064E \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u0657\u0627 \u062B\u064E\u0642\u0650\u064A\u0644\u0657\u0627" }, { id: 28, text: "\u0646\u0651\u064E\u062D\u06E1\u0646\u064F \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0647\u064F\u0645\u06E1 \u0648\u064E\u0634\u064E\u062F\u064E\u062F\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0633\u06E1\u0631\u064E\u0647\u064F\u0645\u06E1\u06D6 \u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0634\u0650\u0626\u06E1\u0646\u064E\u0627 \u0628\u064E\u062F\u0651\u064E\u0644\u06E1\u0646\u064E\u0627\u0653 \u0623\u064E\u0645\u06E1\u062B\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1 \u062A\u064E\u0628\u06E1\u062F\u0650\u064A\u0644\u064B\u0627" }, { id: 29, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u0650\u0647\u0650\u06E6 \u062A\u064E\u0630\u06E1\u0643\u0650\u0631\u064E\u0629\u065E\u06D6 \u0641\u064E\u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0633\u064E\u0628\u0650\u064A\u0644\u0657\u0627" }, { id: 30, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u0650\u064A\u0645\u064B\u0627 \u062D\u064E\u0643\u0650\u064A\u0645\u0657\u0627" }, { id: 31, text: "\u064A\u064F\u062F\u06E1\u062E\u0650\u0644\u064F \u0645\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064F \u0641\u0650\u064A \u0631\u064E\u062D\u06E1\u0645\u064E\u062A\u0650\u0647\u0650\u06E6\u06DA \u0648\u064E\u0671\u0644\u0638\u0651\u064E\u0640\u0670\u0644\u0650\u0645\u0650\u064A\u0646\u064E \u0623\u064E\u0639\u064E\u062F\u0651\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627 \u0623\u064E\u0644\u0650\u064A\u0645\u064E\u06E2\u0627" }] }, { id: 77, name: "\u0627\u0644\u0645\u0631\u0633\u0644\u0627\u062A", transliteration: "Al-Mursalat", type: "meccan", total_verses: 50, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0631\u06E1\u0633\u064E\u0644\u064E\u0670\u062A\u0650 \u0639\u064F\u0631\u06E1\u0641\u0657\u0627" }, { id: 2, text: "\u0641\u064E\u0671\u0644\u06E1\u0639\u064E\u0670\u0635\u0650\u0641\u064E\u0670\u062A\u0650 \u0639\u064E\u0635\u06E1\u0641\u0657\u0627" }, { id: 3, text: "\u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0640\u0670\u0634\u0650\u0631\u064E\u0670\u062A\u0650 \u0646\u064E\u0634\u06E1\u0631\u0657\u0627" }, { id: 4, text: "\u0641\u064E\u0671\u0644\u06E1\u0641\u064E\u0670\u0631\u0650\u0642\u064E\u0670\u062A\u0650 \u0641\u064E\u0631\u06E1\u0642\u0657\u0627" }, { id: 5, text: "\u0641\u064E\u0671\u0644\u06E1\u0645\u064F\u0644\u06E1\u0642\u0650\u064A\u064E\u0670\u062A\u0650 \u0630\u0650\u0643\u06E1\u0631\u064B\u0627" }, { id: 6, text: "\u0639\u064F\u0630\u06E1\u0631\u064B\u0627 \u0623\u064E\u0648\u06E1 \u0646\u064F\u0630\u06E1\u0631\u064B\u0627" }, { id: 7, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u062A\u064F\u0648\u0639\u064E\u062F\u064F\u0648\u0646\u064E \u0644\u064E\u0648\u064E\u0670\u0642\u0650\u0639\u065E" }, { id: 8, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0646\u0651\u064F\u062C\u064F\u0648\u0645\u064F \u0637\u064F\u0645\u0650\u0633\u064E\u062A\u06E1" }, { id: 9, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0641\u064F\u0631\u0650\u062C\u064E\u062A\u06E1" }, { id: 10, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0646\u064F\u0633\u0650\u0641\u064E\u062A\u06E1" }, { id: 11, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0631\u0651\u064F\u0633\u064F\u0644\u064F \u0623\u064F\u0642\u0651\u0650\u062A\u064E\u062A\u06E1" }, { id: 12, text: "\u0644\u0650\u0623\u064E\u064A\u0651\u0650 \u064A\u064E\u0648\u06E1\u0645\u064D \u0623\u064F\u062C\u0651\u0650\u0644\u064E\u062A\u06E1" }, { id: 13, text: "\u0644\u0650\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0641\u064E\u0635\u06E1\u0644\u0650" }, { id: 14, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0635\u06E1\u0644\u0650" }, { id: 15, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 16, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u0646\u064F\u0647\u06E1\u0644\u0650\u0643\u0650 \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u062B\u064F\u0645\u0651\u064E \u0646\u064F\u062A\u06E1\u0628\u0650\u0639\u064F\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u0650\u064A\u0646\u064E" }, { id: 18, text: "\u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u0641\u06E1\u0639\u064E\u0644\u064F \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u062C\u06E1\u0631\u0650\u0645\u0650\u064A\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 20, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u062E\u06E1\u0644\u064F\u0642\u0643\u0651\u064F\u0645 \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0627\u0653\u0621\u0656 \u0645\u0651\u064E\u0647\u0650\u064A\u0646\u0656" }, { id: 21, text: "\u0641\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0641\u0650\u064A \u0642\u064E\u0631\u064E\u0627\u0631\u0656 \u0645\u0651\u064E\u0643\u0650\u064A\u0646\u064D" }, { id: 22, text: "\u0625\u0650\u0644\u064E\u0649\u0670 \u0642\u064E\u062F\u064E\u0631\u0656 \u0645\u0651\u064E\u0639\u06E1\u0644\u064F\u0648\u0645\u0656" }, { id: 23, text: "\u0641\u064E\u0642\u064E\u062F\u064E\u0631\u06E1\u0646\u064E\u0627 \u0641\u064E\u0646\u0650\u0639\u06E1\u0645\u064E \u0671\u0644\u06E1\u0642\u064E\u0670\u062F\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 25, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0643\u0650\u0641\u064E\u0627\u062A\u064B\u0627" }, { id: 26, text: "\u0623\u064E\u062D\u06E1\u064A\u064E\u0627\u0653\u0621\u0657 \u0648\u064E\u0623\u064E\u0645\u06E1\u0648\u064E\u0670\u062A\u0657\u0627" }, { id: 27, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0631\u064E\u0648\u064E\u0670\u0633\u0650\u064A\u064E \u0634\u064E\u0670\u0645\u0650\u062E\u064E\u0670\u062A\u0656 \u0648\u064E\u0623\u064E\u0633\u06E1\u0642\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064F\u0645 \u0645\u0651\u064E\u0627\u0653\u0621\u0657 \u0641\u064F\u0631\u064E\u0627\u062A\u0657\u0627" }, { id: 28, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 29, text: "\u0671\u0646\u0637\u064E\u0644\u0650\u0642\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0671\u0646\u0637\u064E\u0644\u0650\u0642\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670 \u0638\u0650\u0644\u0651\u0656 \u0630\u0650\u064A \u062B\u064E\u0644\u064E\u0670\u062B\u0650 \u0634\u064F\u0639\u064E\u0628\u0656" }, { id: 31, text: "\u0644\u0651\u064E\u0627 \u0638\u064E\u0644\u0650\u064A\u0644\u0656 \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A \u0645\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E\u0628\u0650" }, { id: 32, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u062A\u064E\u0631\u06E1\u0645\u0650\u064A \u0628\u0650\u0634\u064E\u0631\u064E\u0631\u0656 \u0643\u064E\u0671\u0644\u06E1\u0642\u064E\u0635\u06E1\u0631\u0650" }, { id: 33, text: "\u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u06E5 \u062C\u0650\u0645\u064E\u0670\u0644\u064E\u062A\u065E \u0635\u064F\u0641\u06E1\u0631\u065E" }, { id: 34, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 35, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064F \u0644\u064E\u0627 \u064A\u064E\u0646\u0637\u0650\u0642\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0630\u064E\u0646\u064F \u0644\u064E\u0647\u064F\u0645\u06E1 \u0641\u064E\u064A\u064E\u0639\u06E1\u062A\u064E\u0630\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 37, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 38, text: "\u0647\u064E\u0670\u0630\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u0641\u064E\u0635\u06E1\u0644\u0650\u06D6 \u062C\u064E\u0645\u064E\u0639\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 39, text: "\u0641\u064E\u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0644\u064E\u0643\u064F\u0645\u06E1 \u0643\u064E\u064A\u06E1\u062F\u065E \u0641\u064E\u0643\u0650\u064A\u062F\u064F\u0648\u0646\u0650" }, { id: 40, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 41, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0638\u0650\u0644\u064E\u0670\u0644\u0656 \u0648\u064E\u0639\u064F\u064A\u064F\u0648\u0646\u0656" }, { id: 42, text: "\u0648\u064E\u0641\u064E\u0648\u064E\u0670\u0643\u0650\u0647\u064E \u0645\u0650\u0645\u0651\u064E\u0627 \u064A\u064E\u0634\u06E1\u062A\u064E\u0647\u064F\u0648\u0646\u064E" }, { id: 43, text: "\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u0671\u0634\u06E1\u0631\u064E\u0628\u064F\u0648\u0627\u0652 \u0647\u064E\u0646\u0650\u064A\u0653\u0640\u0654\u064E\u06E2\u0627 \u0628\u0650\u0645\u064E\u0627 \u0643\u064F\u0646\u062A\u064F\u0645\u06E1 \u062A\u064E\u0639\u06E1\u0645\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 44, text: "\u0625\u0650\u0646\u0651\u064E\u0627 \u0643\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0646\u064E\u062C\u06E1\u0632\u0650\u064A \u0671\u0644\u06E1\u0645\u064F\u062D\u06E1\u0633\u0650\u0646\u0650\u064A\u0646\u064E" }, { id: 45, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 46, text: "\u0643\u064F\u0644\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u0645\u064E\u062A\u0651\u064E\u0639\u064F\u0648\u0627\u0652 \u0642\u064E\u0644\u0650\u064A\u0644\u064B\u0627 \u0625\u0650\u0646\u0651\u064E\u0643\u064F\u0645 \u0645\u0651\u064F\u062C\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E" }, { id: 47, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 48, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u0650\u064A\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u064F \u0671\u0631\u06E1\u0643\u064E\u0639\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u0643\u064E\u0639\u064F\u0648\u0646\u064E" }, { id: 49, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 50, text: "\u0641\u064E\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u062D\u064E\u062F\u0650\u064A\u062B\u0650\u06ED \u0628\u064E\u0639\u06E1\u062F\u064E\u0647\u064F\u06E5 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }] }, { id: 78, name: "\u0627\u0644\u0646\u0628\u0625", transliteration: "An-Naba", type: "meccan", total_verses: 40, verses: [{ id: 1, text: "\u0639\u064E\u0645\u0651\u064E \u064A\u064E\u062A\u064E\u0633\u064E\u0627\u0653\u0621\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 2, text: "\u0639\u064E\u0646\u0650 \u0671\u0644\u0646\u0651\u064E\u0628\u064E\u0625\u0650 \u0671\u0644\u06E1\u0639\u064E\u0638\u0650\u064A\u0645\u0650" }, { id: 3, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0647\u064F\u0645\u06E1 \u0641\u0650\u064A\u0647\u0650 \u0645\u064F\u062E\u06E1\u062A\u064E\u0644\u0650\u0641\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0643\u064E\u0644\u0651\u064E\u0627 \u0633\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u062B\u064F\u0645\u0651\u064E \u0643\u064E\u0644\u0651\u064E\u0627 \u0633\u064E\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u062C\u06E1\u0639\u064E\u0644\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0645\u0650\u0647\u064E\u0670\u062F\u0657\u0627" }, { id: 7, text: "\u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064E \u0623\u064E\u0648\u06E1\u062A\u064E\u0627\u062F\u0657\u0627" }, { id: 8, text: "\u0648\u064E\u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0623\u064E\u0632\u06E1\u0648\u064E\u0670\u062C\u0657\u0627" }, { id: 9, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0646\u064E\u0648\u06E1\u0645\u064E\u0643\u064F\u0645\u06E1 \u0633\u064F\u0628\u064E\u0627\u062A\u0657\u0627" }, { id: 10, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u064E \u0644\u0650\u0628\u064E\u0627\u0633\u0657\u0627" }, { id: 11, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u064E \u0645\u064E\u0639\u064E\u0627\u0634\u0657\u0627" }, { id: 12, text: "\u0648\u064E\u0628\u064E\u0646\u064E\u064A\u06E1\u0646\u064E\u0627 \u0641\u064E\u0648\u06E1\u0642\u064E\u0643\u064F\u0645\u06E1 \u0633\u064E\u0628\u06E1\u0639\u0657\u0627 \u0634\u0650\u062F\u064E\u0627\u062F\u0657\u0627" }, { id: 13, text: "\u0648\u064E\u062C\u064E\u0639\u064E\u0644\u06E1\u0646\u064E\u0627 \u0633\u0650\u0631\u064E\u0627\u062C\u0657\u0627 \u0648\u064E\u0647\u0651\u064E\u0627\u062C\u0657\u0627" }, { id: 14, text: "\u0648\u064E\u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0627 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0645\u064F\u0639\u06E1\u0635\u0650\u0631\u064E\u0670\u062A\u0650 \u0645\u064E\u0627\u0653\u0621\u0657 \u062B\u064E\u062C\u0651\u064E\u0627\u062C\u0657\u0627" }, { id: 15, text: "\u0644\u0651\u0650\u0646\u064F\u062E\u06E1\u0631\u0650\u062C\u064E \u0628\u0650\u0647\u0650\u06E6 \u062D\u064E\u0628\u0651\u0657\u0627 \u0648\u064E\u0646\u064E\u0628\u064E\u0627\u062A\u0657\u0627" }, { id: 16, text: "\u0648\u064E\u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u064D \u0623\u064E\u0644\u06E1\u0641\u064E\u0627\u0641\u064B\u0627" }, { id: 17, text: "\u0625\u0650\u0646\u0651\u064E \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u06E1\u0641\u064E\u0635\u06E1\u0644\u0650 \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u064A\u0642\u064E\u0670\u062A\u0657\u0627" }, { id: 18, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064F\u0646\u0641\u064E\u062E\u064F \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u0648\u0631\u0650 \u0641\u064E\u062A\u064E\u0623\u06E1\u062A\u064F\u0648\u0646\u064E \u0623\u064E\u0641\u06E1\u0648\u064E\u0627\u062C\u0657\u0627" }, { id: 19, text: "\u0648\u064E\u0641\u064F\u062A\u0650\u062D\u064E\u062A\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0641\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0623\u064E\u0628\u06E1\u0648\u064E\u0670\u0628\u0657\u0627" }, { id: 20, text: "\u0648\u064E\u0633\u064F\u064A\u0651\u0650\u0631\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0641\u064E\u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0633\u064E\u0631\u064E\u0627\u0628\u064B\u0627" }, { id: 21, text: "\u0625\u0650\u0646\u0651\u064E \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0643\u064E\u0627\u0646\u064E\u062A\u06E1 \u0645\u0650\u0631\u06E1\u0635\u064E\u0627\u062F\u0657\u0627" }, { id: 22, text: "\u0644\u0651\u0650\u0644\u0637\u0651\u064E\u0640\u0670\u063A\u0650\u064A\u0646\u064E \u0645\u064E\u0640\u0654\u064E\u0627\u0628\u0657\u0627" }, { id: 23, text: "\u0644\u0651\u064E\u0640\u0670\u0628\u0650\u062B\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u062D\u06E1\u0642\u064E\u0627\u0628\u0657\u0627" }, { id: 24, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0628\u064E\u0631\u06E1\u062F\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0634\u064E\u0631\u064E\u0627\u0628\u064B\u0627" }, { id: 25, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u062D\u064E\u0645\u0650\u064A\u0645\u0657\u0627 \u0648\u064E\u063A\u064E\u0633\u0651\u064E\u0627\u0642\u0657\u0627" }, { id: 26, text: "\u062C\u064E\u0632\u064E\u0627\u0653\u0621\u0657 \u0648\u0650\u0641\u064E\u0627\u0642\u064B\u0627" }, { id: 27, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0644\u064E\u0627 \u064A\u064E\u0631\u06E1\u062C\u064F\u0648\u0646\u064E \u062D\u0650\u0633\u064E\u0627\u0628\u0657\u0627" }, { id: 28, text: "\u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0643\u0650\u0630\u0651\u064E\u0627\u0628\u0657\u0627" }, { id: 29, text: "\u0648\u064E\u0643\u064F\u0644\u0651\u064E \u0634\u064E\u064A\u06E1\u0621\u064D \u0623\u064E\u062D\u06E1\u0635\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0643\u0650\u062A\u064E\u0670\u0628\u0657\u0627" }, { id: 30, text: "\u0641\u064E\u0630\u064F\u0648\u0642\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0646 \u0646\u0651\u064E\u0632\u0650\u064A\u062F\u064E\u0643\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0630\u064E\u0627\u0628\u064B\u0627" }, { id: 31, text: "\u0625\u0650\u0646\u0651\u064E \u0644\u0650\u0644\u06E1\u0645\u064F\u062A\u0651\u064E\u0642\u0650\u064A\u0646\u064E \u0645\u064E\u0641\u064E\u0627\u0632\u064B\u0627" }, { id: 32, text: "\u062D\u064E\u062F\u064E\u0627\u0653\u0626\u0650\u0642\u064E \u0648\u064E\u0623\u064E\u0639\u06E1\u0646\u064E\u0670\u0628\u0657\u0627" }, { id: 33, text: "\u0648\u064E\u0643\u064E\u0648\u064E\u0627\u0639\u0650\u0628\u064E \u0623\u064E\u062A\u06E1\u0631\u064E\u0627\u0628\u0657\u0627" }, { id: 34, text: "\u0648\u064E\u0643\u064E\u0623\u06E1\u0633\u0657\u0627 \u062F\u0650\u0647\u064E\u0627\u0642\u0657\u0627" }, { id: 35, text: "\u0644\u0651\u064E\u0627 \u064A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F\u0648\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064E\u063A\u06E1\u0648\u0657\u0627 \u0648\u064E\u0644\u064E\u0627 \u0643\u0650\u0630\u0651\u064E\u0640\u0670\u0628\u0657\u0627" }, { id: 36, text: "\u062C\u064E\u0632\u064E\u0627\u0653\u0621\u0657 \u0645\u0651\u0650\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0643\u064E \u0639\u064E\u0637\u064E\u0627\u0653\u0621\u064B \u062D\u0650\u0633\u064E\u0627\u0628\u0657\u0627" }, { id: 37, text: "\u0631\u0651\u064E\u0628\u0651\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u064A\u06E1\u0646\u064E\u0647\u064F\u0645\u064E\u0627 \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u0650\u06D6 \u0644\u064E\u0627 \u064A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F\u0648\u0646\u064E \u0645\u0650\u0646\u06E1\u0647\u064F \u062E\u0650\u0637\u064E\u0627\u0628\u0657\u0627" }, { id: 38, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0642\u064F\u0648\u0645\u064F \u0671\u0644\u0631\u0651\u064F\u0648\u062D\u064F \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0635\u064E\u0641\u0651\u0657\u0627\u06D6 \u0644\u0651\u064E\u0627 \u064A\u064E\u062A\u064E\u0643\u064E\u0644\u0651\u064E\u0645\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0630\u0650\u0646\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u0631\u0651\u064E\u062D\u06E1\u0645\u064E\u0670\u0646\u064F \u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0635\u064E\u0648\u064E\u0627\u0628\u0657\u0627" }, { id: 39, text: "\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u064F\u06D6 \u0641\u064E\u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u062A\u0651\u064E\u062E\u064E\u0630\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0645\u064E\u0640\u0654\u064E\u0627\u0628\u064B\u0627" }, { id: 40, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0630\u064E\u0631\u06E1\u0646\u064E\u0670\u0643\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u0657\u0627 \u0642\u064E\u0631\u0650\u064A\u0628\u0657\u0627 \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0646\u0638\u064F\u0631\u064F \u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u0621\u064F \u0645\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u064A\u064E\u062F\u064E\u0627\u0647\u064F \u0648\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0671\u0644\u06E1\u0643\u064E\u0627\u0641\u0650\u0631\u064F \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0643\u064F\u0646\u062A\u064F \u062A\u064F\u0631\u064E\u0670\u0628\u064E\u06E2\u0627" }] }, { id: 79, name: "\u0627\u0644\u0646\u0627\u0632\u0639\u0627\u062A", transliteration: "An-Nazi'at", type: "meccan", total_verses: 46, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0640\u0670\u0632\u0650\u0639\u064E\u0670\u062A\u0650 \u063A\u064E\u0631\u06E1\u0642\u0657\u0627" }, { id: 2, text: "\u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0640\u0670\u0634\u0650\u0637\u064E\u0670\u062A\u0650 \u0646\u064E\u0634\u06E1\u0637\u0657\u0627" }, { id: 3, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0640\u0670\u0628\u0650\u062D\u064E\u0670\u062A\u0650 \u0633\u064E\u0628\u06E1\u062D\u0657\u0627" }, { id: 4, text: "\u0641\u064E\u0671\u0644\u0633\u0651\u064E\u0640\u0670\u0628\u0650\u0642\u064E\u0670\u062A\u0650 \u0633\u064E\u0628\u06E1\u0642\u0657\u0627" }, { id: 5, text: "\u0641\u064E\u0671\u0644\u06E1\u0645\u064F\u062F\u064E\u0628\u0651\u0650\u0631\u064E\u0670\u062A\u0650 \u0623\u064E\u0645\u06E1\u0631\u0657\u0627" }, { id: 6, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064E\u0631\u06E1\u062C\u064F\u0641\u064F \u0671\u0644\u0631\u0651\u064E\u0627\u062C\u0650\u0641\u064E\u0629\u064F" }, { id: 7, text: "\u062A\u064E\u062A\u06E1\u0628\u064E\u0639\u064F\u0647\u064E\u0627 \u0671\u0644\u0631\u0651\u064E\u0627\u062F\u0650\u0641\u064E\u0629\u064F" }, { id: 8, text: "\u0642\u064F\u0644\u064F\u0648\u0628\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0648\u064E\u0627\u062C\u0650\u0641\u064E\u0629\u064C" }, { id: 9, text: "\u0623\u064E\u0628\u06E1\u0635\u064E\u0670\u0631\u064F\u0647\u064E\u0627 \u062E\u064E\u0670\u0634\u0650\u0639\u064E\u0629\u065E" }, { id: 10, text: "\u064A\u064E\u0642\u064F\u0648\u0644\u064F\u0648\u0646\u064E \u0623\u064E\u0621\u0650\u0646\u0651\u064E\u0627 \u0644\u064E\u0645\u064E\u0631\u06E1\u062F\u064F\u0648\u062F\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064E\u0627\u0641\u0650\u0631\u064E\u0629\u0650" }, { id: 11, text: "\u0623\u064E\u0621\u0650\u0630\u064E\u0627 \u0643\u064F\u0646\u0651\u064E\u0627 \u0639\u0650\u0638\u064E\u0670\u0645\u0657\u0627 \u0646\u0651\u064E\u062E\u0650\u0631\u064E\u0629\u0657" }, { id: 12, text: "\u0642\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u062A\u0650\u0644\u06E1\u0643\u064E \u0625\u0650\u0630\u0657\u0627 \u0643\u064E\u0631\u0651\u064E\u0629\u064C \u062E\u064E\u0627\u0633\u0650\u0631\u064E\u0629\u065E" }, { id: 13, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627 \u0647\u0650\u064A\u064E \u0632\u064E\u062C\u06E1\u0631\u064E\u0629\u065E \u0648\u064E\u0670\u062D\u0650\u062F\u064E\u0629\u065E" }, { id: 14, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0647\u064F\u0645 \u0628\u0650\u0671\u0644\u0633\u0651\u064E\u0627\u0647\u0650\u0631\u064E\u0629\u0650" }, { id: 15, text: "\u0647\u064E\u0644\u06E1 \u0623\u064E\u062A\u064E\u0649\u0670\u0643\u064E \u062D\u064E\u062F\u0650\u064A\u062B\u064F \u0645\u064F\u0648\u0633\u064E\u0649\u0670\u0653" }, { id: 16, text: "\u0625\u0650\u0630\u06E1 \u0646\u064E\u0627\u062F\u064E\u0649\u0670\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u06E5 \u0628\u0650\u0671\u0644\u06E1\u0648\u064E\u0627\u062F\u0650 \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u062F\u0651\u064E\u0633\u0650 \u0637\u064F\u0648\u064B\u0649" }, { id: 17, text: "\u0671\u0630\u06E1\u0647\u064E\u0628\u06E1 \u0625\u0650\u0644\u064E\u0649\u0670 \u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0637\u064E\u063A\u064E\u0649\u0670" }, { id: 18, text: "\u0641\u064E\u0642\u064F\u0644\u06E1 \u0647\u064E\u0644 \u0644\u0651\u064E\u0643\u064E \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0646 \u062A\u064E\u0632\u064E\u0643\u0651\u064E\u0649\u0670" }, { id: 19, text: "\u0648\u064E\u0623\u064E\u0647\u06E1\u062F\u0650\u064A\u064E\u0643\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u062A\u064E\u062E\u06E1\u0634\u064E\u0649\u0670" }, { id: 20, text: "\u0641\u064E\u0623\u064E\u0631\u064E\u0649\u0670\u0647\u064F \u0671\u0644\u06E1\u0623\u0653\u064A\u064E\u0629\u064E \u0671\u0644\u06E1\u0643\u064F\u0628\u06E1\u0631\u064E\u0649\u0670" }, { id: 21, text: "\u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0648\u064E\u0639\u064E\u0635\u064E\u0649\u0670" }, { id: 22, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u062F\u06E1\u0628\u064E\u0631\u064E \u064A\u064E\u0633\u06E1\u0639\u064E\u0649\u0670" }, { id: 23, text: "\u0641\u064E\u062D\u064E\u0634\u064E\u0631\u064E \u0641\u064E\u0646\u064E\u0627\u062F\u064E\u0649\u0670" }, { id: 24, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0646\u064E\u0627\u06E0 \u0631\u064E\u0628\u0651\u064F\u0643\u064F\u0645\u064F \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0649\u0670" }, { id: 25, text: "\u0641\u064E\u0623\u064E\u062E\u064E\u0630\u064E\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0646\u064E\u0643\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670\u0653" }, { id: 26, text: "\u0625\u0650\u0646\u0651\u064E \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0639\u0650\u0628\u06E1\u0631\u064E\u0629\u0657 \u0644\u0651\u0650\u0645\u064E\u0646 \u064A\u064E\u062E\u06E1\u0634\u064E\u0649\u0670\u0653" }, { id: 27, text: "\u0621\u064E\u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0623\u064E\u0634\u064E\u062F\u0651\u064F \u062E\u064E\u0644\u06E1\u0642\u064B\u0627 \u0623\u064E\u0645\u0650 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F\u06DA \u0628\u064E\u0646\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 28, text: "\u0631\u064E\u0641\u064E\u0639\u064E \u0633\u064E\u0645\u06E1\u0643\u064E\u0647\u064E\u0627 \u0641\u064E\u0633\u064E\u0648\u0651\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 29, text: "\u0648\u064E\u0623\u064E\u063A\u06E1\u0637\u064E\u0634\u064E \u0644\u064E\u064A\u06E1\u0644\u064E\u0647\u064E\u0627 \u0648\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u0636\u064F\u062D\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 30, text: "\u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0628\u064E\u0639\u06E1\u062F\u064E \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062F\u064E\u062D\u064E\u0649\u0670\u0647\u064E\u0627\u0653" }, { id: 31, text: "\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u0645\u0650\u0646\u06E1\u0647\u064E\u0627 \u0645\u064E\u0627\u0653\u0621\u064E\u0647\u064E\u0627 \u0648\u064E\u0645\u064E\u0631\u06E1\u0639\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 32, text: "\u0648\u064E\u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064E \u0623\u064E\u0631\u06E1\u0633\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 33, text: "\u0645\u064E\u062A\u064E\u0670\u0639\u0657\u0627 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650\u0643\u064F\u0645\u06E1" }, { id: 34, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u0650 \u0671\u0644\u0637\u0651\u064E\u0627\u0653\u0645\u0651\u064E\u0629\u064F \u0671\u0644\u06E1\u0643\u064F\u0628\u06E1\u0631\u064E\u0649\u0670" }, { id: 35, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0645\u064E\u0627 \u0633\u064E\u0639\u064E\u0649\u0670" }, { id: 36, text: "\u0648\u064E\u0628\u064F\u0631\u0651\u0650\u0632\u064E\u062A\u0650 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u064F \u0644\u0650\u0645\u064E\u0646 \u064A\u064E\u0631\u064E\u0649\u0670" }, { id: 37, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646 \u0637\u064E\u063A\u064E\u0649\u0670" }, { id: 38, text: "\u0648\u064E\u0621\u064E\u0627\u062B\u064E\u0631\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627" }, { id: 39, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u064E \u0647\u0650\u064A\u064E \u0671\u0644\u06E1\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670" }, { id: 40, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u062E\u064E\u0627\u0641\u064E \u0645\u064E\u0642\u064E\u0627\u0645\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0648\u064E\u0646\u064E\u0647\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0641\u06E1\u0633\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u06E1\u0647\u064E\u0648\u064E\u0649\u0670" }, { id: 41, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064E \u0647\u0650\u064A\u064E \u0671\u0644\u06E1\u0645\u064E\u0623\u06E1\u0648\u064E\u0649\u0670" }, { id: 42, text: "\u064A\u064E\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0648\u0646\u064E\u0643\u064E \u0639\u064E\u0646\u0650 \u0671\u0644\u0633\u0651\u064E\u0627\u0639\u064E\u0629\u0650 \u0623\u064E\u064A\u0651\u064E\u0627\u0646\u064E \u0645\u064F\u0631\u06E1\u0633\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 43, text: "\u0641\u0650\u064A\u0645\u064E \u0623\u064E\u0646\u062A\u064E \u0645\u0650\u0646 \u0630\u0650\u0643\u06E1\u0631\u064E\u0649\u0670\u0647\u064E\u0627\u0653" }, { id: 44, text: "\u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0645\u064F\u0646\u062A\u064E\u0647\u064E\u0649\u0670\u0647\u064E\u0627\u0653" }, { id: 45, text: "\u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0645\u064F\u0646\u0630\u0650\u0631\u064F \u0645\u064E\u0646 \u064A\u064E\u062E\u06E1\u0634\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 46, text: "\u0643\u064E\u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0631\u064E\u0648\u06E1\u0646\u064E\u0647\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0644\u06E1\u0628\u064E\u062B\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0639\u064E\u0634\u0650\u064A\u0651\u064E\u0629\u064B \u0623\u064E\u0648\u06E1 \u0636\u064F\u062D\u064E\u0649\u0670\u0647\u064E\u0627" }] }, { id: 80, name: "\u0639\u0628\u0633", transliteration: "'Abasa", type: "meccan", total_verses: 42, verses: [{ id: 1, text: "\u0639\u064E\u0628\u064E\u0633\u064E \u0648\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670\u0653" }, { id: 2, text: "\u0623\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u0647\u064F \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0645\u064E\u0649\u0670" }, { id: 3, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u062F\u06E1\u0631\u0650\u064A\u0643\u064E \u0644\u064E\u0639\u064E\u0644\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0632\u0651\u064E\u0643\u0651\u064E\u0649\u0670\u0653" }, { id: 4, text: "\u0623\u064E\u0648\u06E1 \u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F \u0641\u064E\u062A\u064E\u0646\u0641\u064E\u0639\u064E\u0647\u064F \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E\u0649\u0670\u0653" }, { id: 5, text: "\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u0650 \u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0646\u064E\u0649\u0670" }, { id: 6, text: "\u0641\u064E\u0623\u064E\u0646\u062A\u064E \u0644\u064E\u0647\u064F\u06E5 \u062A\u064E\u0635\u064E\u062F\u0651\u064E\u0649\u0670" }, { id: 7, text: "\u0648\u064E\u0645\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064E \u0623\u064E\u0644\u0651\u064E\u0627 \u064A\u064E\u0632\u0651\u064E\u0643\u0651\u064E\u0649\u0670" }, { id: 8, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646 \u062C\u064E\u0627\u0653\u0621\u064E\u0643\u064E \u064A\u064E\u0633\u06E1\u0639\u064E\u0649\u0670" }, { id: 9, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u064A\u064E\u062E\u06E1\u0634\u064E\u0649\u0670" }, { id: 10, text: "\u0641\u064E\u0623\u064E\u0646\u062A\u064E \u0639\u064E\u0646\u06E1\u0647\u064F \u062A\u064E\u0644\u064E\u0647\u0651\u064E\u0649\u0670" }, { id: 11, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u062A\u064E\u0630\u06E1\u0643\u0650\u0631\u064E\u0629\u065E" }, { id: 12, text: "\u0641\u064E\u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0630\u064E\u0643\u064E\u0631\u064E\u0647\u064F\u06E5" }, { id: 13, text: "\u0641\u0650\u064A \u0635\u064F\u062D\u064F\u0641\u0656 \u0645\u0651\u064F\u0643\u064E\u0631\u0651\u064E\u0645\u064E\u0629\u0656" }, { id: 14, text: "\u0645\u0651\u064E\u0631\u06E1\u0641\u064F\u0648\u0639\u064E\u0629\u0656 \u0645\u0651\u064F\u0637\u064E\u0647\u0651\u064E\u0631\u064E\u0629\u0650\u06ED" }, { id: 15, text: "\u0628\u0650\u0623\u064E\u064A\u06E1\u062F\u0650\u064A \u0633\u064E\u0641\u064E\u0631\u064E\u0629\u0656" }, { id: 16, text: "\u0643\u0650\u0631\u064E\u0627\u0645\u0650\u06ED \u0628\u064E\u0631\u064E\u0631\u064E\u0629\u0656" }, { id: 17, text: "\u0642\u064F\u062A\u0650\u0644\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0645\u064E\u0627\u0653 \u0623\u064E\u0643\u06E1\u0641\u064E\u0631\u064E\u0647\u064F\u06E5" }, { id: 18, text: "\u0645\u0650\u0646\u06E1 \u0623\u064E\u064A\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u064D \u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064F\u06E5" }, { id: 19, text: "\u0645\u0650\u0646 \u0646\u0651\u064F\u0637\u06E1\u0641\u064E\u0629\u064D \u062E\u064E\u0644\u064E\u0642\u064E\u0647\u064F\u06E5 \u0641\u064E\u0642\u064E\u062F\u0651\u064E\u0631\u064E\u0647\u064F\u06E5" }, { id: 20, text: "\u062B\u064F\u0645\u0651\u064E \u0671\u0644\u0633\u0651\u064E\u0628\u0650\u064A\u0644\u064E \u064A\u064E\u0633\u0651\u064E\u0631\u064E\u0647\u064F\u06E5" }, { id: 21, text: "\u062B\u064F\u0645\u0651\u064E \u0623\u064E\u0645\u064E\u0627\u062A\u064E\u0647\u064F\u06E5 \u0641\u064E\u0623\u064E\u0642\u06E1\u0628\u064E\u0631\u064E\u0647\u064F\u06E5" }, { id: 22, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0630\u064E\u0627 \u0634\u064E\u0627\u0653\u0621\u064E \u0623\u064E\u0646\u0634\u064E\u0631\u064E\u0647\u064F\u06E5" }, { id: 23, text: "\u0643\u064E\u0644\u0651\u064E\u0627 \u0644\u064E\u0645\u0651\u064E\u0627 \u064A\u064E\u0642\u06E1\u0636\u0650 \u0645\u064E\u0627\u0653 \u0623\u064E\u0645\u064E\u0631\u064E\u0647\u064F\u06E5" }, { id: 24, text: "\u0641\u064E\u0644\u06E1\u064A\u064E\u0646\u0638\u064F\u0631\u0650 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0625\u0650\u0644\u064E\u0649\u0670 \u0637\u064E\u0639\u064E\u0627\u0645\u0650\u0647\u0650\u06E6\u0653" }, { id: 25, text: "\u0623\u064E\u0646\u0651\u064E\u0627 \u0635\u064E\u0628\u064E\u0628\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0627\u0653\u0621\u064E \u0635\u064E\u0628\u0651\u0657\u0627" }, { id: 26, text: "\u062B\u064F\u0645\u0651\u064E \u0634\u064E\u0642\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064E \u0634\u064E\u0642\u0651\u0657\u0627" }, { id: 27, text: "\u0641\u064E\u0623\u064E\u0646\u06E2\u0628\u064E\u062A\u06E1\u0646\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u062D\u064E\u0628\u0651\u0657\u0627" }, { id: 28, text: "\u0648\u064E\u0639\u0650\u0646\u064E\u0628\u0657\u0627 \u0648\u064E\u0642\u064E\u0636\u06E1\u0628\u0657\u0627" }, { id: 29, text: "\u0648\u064E\u0632\u064E\u064A\u06E1\u062A\u064F\u0648\u0646\u0657\u0627 \u0648\u064E\u0646\u064E\u062E\u06E1\u0644\u0657\u0627" }, { id: 30, text: "\u0648\u064E\u062D\u064E\u062F\u064E\u0627\u0653\u0626\u0650\u0642\u064E \u063A\u064F\u0644\u06E1\u0628\u0657\u0627" }, { id: 31, text: "\u0648\u064E\u0641\u064E\u0670\u0643\u0650\u0647\u064E\u0629\u0657 \u0648\u064E\u0623\u064E\u0628\u0651\u0657\u0627" }, { id: 32, text: "\u0645\u0651\u064E\u062A\u064E\u0670\u0639\u0657\u0627 \u0644\u0651\u064E\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u0623\u064E\u0646\u06E1\u0639\u064E\u0670\u0645\u0650\u0643\u064F\u0645\u06E1" }, { id: 33, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u0650 \u0671\u0644\u0635\u0651\u064E\u0627\u0653\u062E\u0651\u064E\u0629\u064F" }, { id: 34, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0641\u0650\u0631\u0651\u064F \u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u0621\u064F \u0645\u0650\u0646\u06E1 \u0623\u064E\u062E\u0650\u064A\u0647\u0650" }, { id: 35, text: "\u0648\u064E\u0623\u064F\u0645\u0651\u0650\u0647\u0650\u06E6 \u0648\u064E\u0623\u064E\u0628\u0650\u064A\u0647\u0650" }, { id: 36, text: "\u0648\u064E\u0635\u064E\u0670\u062D\u0650\u0628\u064E\u062A\u0650\u0647\u0650\u06E6 \u0648\u064E\u0628\u064E\u0646\u0650\u064A\u0647\u0650" }, { id: 37, text: "\u0644\u0650\u0643\u064F\u0644\u0651\u0650 \u0671\u0645\u06E1\u0631\u0650\u064A\u0655\u0656 \u0645\u0651\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0634\u064E\u0623\u06E1\u0646\u065E \u064A\u064F\u063A\u06E1\u0646\u0650\u064A\u0647\u0650" }, { id: 38, text: "\u0648\u064F\u062C\u064F\u0648\u0647\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0645\u0651\u064F\u0633\u06E1\u0641\u0650\u0631\u064E\u0629\u065E" }, { id: 39, text: "\u0636\u064E\u0627\u062D\u0650\u0643\u064E\u0629\u065E \u0645\u0651\u064F\u0633\u06E1\u062A\u064E\u0628\u06E1\u0634\u0650\u0631\u064E\u0629\u065E" }, { id: 40, text: "\u0648\u064E\u0648\u064F\u062C\u064F\u0648\u0647\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u063A\u064E\u0628\u064E\u0631\u064E\u0629\u065E" }, { id: 41, text: "\u062A\u064E\u0631\u06E1\u0647\u064E\u0642\u064F\u0647\u064E\u0627 \u0642\u064E\u062A\u064E\u0631\u064E\u0629\u064C" }, { id: 42, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0643\u064E\u0641\u064E\u0631\u064E\u0629\u064F \u0671\u0644\u06E1\u0641\u064E\u062C\u064E\u0631\u064E\u0629\u064F" }] }, { id: 81, name: "\u0627\u0644\u062A\u0643\u0648\u064A\u0631", transliteration: "At-Takwir", type: "meccan", total_verses: 29, verses: [{ id: 1, text: "\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u064F \u0643\u064F\u0648\u0651\u0650\u0631\u064E\u062A\u06E1" }, { id: 2, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0646\u0651\u064F\u062C\u064F\u0648\u0645\u064F \u0671\u0646\u0643\u064E\u062F\u064E\u0631\u064E\u062A\u06E1" }, { id: 3, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0633\u064F\u064A\u0651\u0650\u0631\u064E\u062A\u06E1" }, { id: 4, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u0639\u0650\u0634\u064E\u0627\u0631\u064F \u0639\u064F\u0637\u0651\u0650\u0644\u064E\u062A\u06E1" }, { id: 5, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u0648\u064F\u062D\u064F\u0648\u0634\u064F \u062D\u064F\u0634\u0650\u0631\u064E\u062A\u06E1" }, { id: 6, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u0628\u0650\u062D\u064E\u0627\u0631\u064F \u0633\u064F\u062C\u0651\u0650\u0631\u064E\u062A\u06E1" }, { id: 7, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0646\u0651\u064F\u0641\u064F\u0648\u0633\u064F \u0632\u064F\u0648\u0651\u0650\u062C\u064E\u062A\u06E1" }, { id: 8, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u0621\u064F\u06E5\u062F\u064E\u0629\u064F \u0633\u064F\u0626\u0650\u0644\u064E\u062A\u06E1" }, { id: 9, text: "\u0628\u0650\u0623\u064E\u064A\u0651\u0650 \u0630\u064E\u0646\u06E2\u0628\u0656 \u0642\u064F\u062A\u0650\u0644\u064E\u062A\u06E1" }, { id: 10, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0635\u0651\u064F\u062D\u064F\u0641\u064F \u0646\u064F\u0634\u0650\u0631\u064E\u062A\u06E1" }, { id: 11, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0643\u064F\u0634\u0650\u0637\u064E\u062A\u06E1" }, { id: 12, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u064F \u0633\u064F\u0639\u0651\u0650\u0631\u064E\u062A\u06E1" }, { id: 13, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u062C\u064E\u0646\u0651\u064E\u0629\u064F \u0623\u064F\u0632\u06E1\u0644\u0650\u0641\u064E\u062A\u06E1" }, { id: 14, text: "\u0639\u064E\u0644\u0650\u0645\u064E\u062A\u06E1 \u0646\u064E\u0641\u06E1\u0633\u065E \u0645\u0651\u064E\u0627\u0653 \u0623\u064E\u062D\u06E1\u0636\u064E\u0631\u064E\u062A\u06E1" }, { id: 15, text: "\u0641\u064E\u0644\u064E\u0627\u0653 \u0623\u064F\u0642\u06E1\u0633\u0650\u0645\u064F \u0628\u0650\u0671\u0644\u06E1\u062E\u064F\u0646\u0651\u064E\u0633\u0650" }, { id: 16, text: "\u0671\u0644\u06E1\u062C\u064E\u0648\u064E\u0627\u0631\u0650 \u0671\u0644\u06E1\u0643\u064F\u0646\u0651\u064E\u0633\u0650" }, { id: 17, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0625\u0650\u0630\u064E\u0627 \u0639\u064E\u0633\u06E1\u0639\u064E\u0633\u064E" }, { id: 18, text: "\u0648\u064E\u0671\u0644\u0635\u0651\u064F\u0628\u06E1\u062D\u0650 \u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u0646\u064E\u0641\u0651\u064E\u0633\u064E" }, { id: 19, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0642\u064E\u0648\u06E1\u0644\u064F \u0631\u064E\u0633\u064F\u0648\u0644\u0656 \u0643\u064E\u0631\u0650\u064A\u0645\u0656" }, { id: 20, text: "\u0630\u0650\u064A \u0642\u064F\u0648\u0651\u064E\u0629\u064D \u0639\u0650\u0646\u062F\u064E \u0630\u0650\u064A \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0645\u064E\u0643\u0650\u064A\u0646\u0656" }, { id: 21, text: "\u0645\u0651\u064F\u0637\u064E\u0627\u0639\u0656 \u062B\u064E\u0645\u0651\u064E \u0623\u064E\u0645\u0650\u064A\u0646\u0656" }, { id: 22, text: "\u0648\u064E\u0645\u064E\u0627 \u0635\u064E\u0627\u062D\u0650\u0628\u064F\u0643\u064F\u0645 \u0628\u0650\u0645\u064E\u062C\u06E1\u0646\u064F\u0648\u0646\u0656" }, { id: 23, text: "\u0648\u064E\u0644\u064E\u0642\u064E\u062F\u06E1 \u0631\u064E\u0621\u064E\u0627\u0647\u064F \u0628\u0650\u0671\u0644\u06E1\u0623\u064F\u0641\u064F\u0642\u0650 \u0671\u0644\u06E1\u0645\u064F\u0628\u0650\u064A\u0646\u0650" }, { id: 24, text: "\u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u063A\u064E\u064A\u06E1\u0628\u0650 \u0628\u0650\u0636\u064E\u0646\u0650\u064A\u0646\u0656" }, { id: 25, text: "\u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0628\u0650\u0642\u064E\u0648\u06E1\u0644\u0650 \u0634\u064E\u064A\u06E1\u0637\u064E\u0670\u0646\u0656 \u0631\u0651\u064E\u062C\u0650\u064A\u0645\u0656" }, { id: 26, text: "\u0641\u064E\u0623\u064E\u064A\u06E1\u0646\u064E \u062A\u064E\u0630\u06E1\u0647\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0625\u0650\u0646\u06E1 \u0647\u064F\u0648\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0630\u0650\u0643\u06E1\u0631\u065E \u0644\u0651\u0650\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 28, text: "\u0644\u0650\u0645\u064E\u0646 \u0634\u064E\u0627\u0653\u0621\u064E \u0645\u0650\u0646\u0643\u064F\u0645\u06E1 \u0623\u064E\u0646 \u064A\u064E\u0633\u06E1\u062A\u064E\u0642\u0650\u064A\u0645\u064E" }, { id: 29, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0634\u064E\u0627\u0653\u0621\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064E\u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0631\u064E\u0628\u0651\u064F \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }] }, { id: 82, name: "\u0627\u0644\u0625\u0646\u0641\u0637\u0627\u0631", transliteration: "Al-Infitar", type: "meccan", total_verses: 19, verses: [{ id: 1, text: "\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0671\u0646\u0641\u064E\u0637\u064E\u0631\u064E\u062A\u06E1" }, { id: 2, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u0643\u064E\u0648\u064E\u0627\u0643\u0650\u0628\u064F \u0671\u0646\u062A\u064E\u062B\u064E\u0631\u064E\u062A\u06E1" }, { id: 3, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u0628\u0650\u062D\u064E\u0627\u0631\u064F \u0641\u064F\u062C\u0651\u0650\u0631\u064E\u062A\u06E1" }, { id: 4, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u0642\u064F\u0628\u064F\u0648\u0631\u064F \u0628\u064F\u0639\u06E1\u062B\u0650\u0631\u064E\u062A\u06E1" }, { id: 5, text: "\u0639\u064E\u0644\u0650\u0645\u064E\u062A\u06E1 \u0646\u064E\u0641\u06E1\u0633\u065E \u0645\u0651\u064E\u0627 \u0642\u064E\u062F\u0651\u064E\u0645\u064E\u062A\u06E1 \u0648\u064E\u0623\u064E\u062E\u0651\u064E\u0631\u064E\u062A\u06E1" }, { id: 6, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0645\u064E\u0627 \u063A\u064E\u0631\u0651\u064E\u0643\u064E \u0628\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u0643\u064E\u0631\u0650\u064A\u0645\u0650" }, { id: 7, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E\u0643\u064E \u0641\u064E\u0633\u064E\u0648\u0651\u064E\u0649\u0670\u0643\u064E \u0641\u064E\u0639\u064E\u062F\u064E\u0644\u064E\u0643\u064E" }, { id: 8, text: "\u0641\u0650\u064A\u0653 \u0623\u064E\u064A\u0651\u0650 \u0635\u064F\u0648\u0631\u064E\u0629\u0656 \u0645\u0651\u064E\u0627 \u0634\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0643\u0651\u064E\u0628\u064E\u0643\u064E" }, { id: 9, text: "\u0643\u064E\u0644\u0651\u064E\u0627 \u0628\u064E\u0644\u06E1 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 10, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0643\u064F\u0645\u06E1 \u0644\u064E\u062D\u064E\u0670\u0641\u0650\u0638\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u0643\u0650\u0631\u064E\u0627\u0645\u0657\u0627 \u0643\u064E\u0670\u062A\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 12, text: "\u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0645\u064E\u0627 \u062A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }, { id: 13, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0631\u064E\u0627\u0631\u064E \u0644\u064E\u0641\u0650\u064A \u0646\u064E\u0639\u0650\u064A\u0645\u0656" }, { id: 14, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0641\u064F\u062C\u0651\u064E\u0627\u0631\u064E \u0644\u064E\u0641\u0650\u064A \u062C\u064E\u062D\u0650\u064A\u0645\u0656" }, { id: 15, text: "\u064A\u064E\u0635\u06E1\u0644\u064E\u0648\u06E1\u0646\u064E\u0647\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 16, text: "\u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0645\u06E1 \u0639\u064E\u0646\u06E1\u0647\u064E\u0627 \u0628\u0650\u063A\u064E\u0627\u0653\u0626\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 17, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 18, text: "\u062B\u064F\u0645\u0651\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u064A\u064E\u0648\u06E1\u0645\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 19, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u0644\u064E\u0627 \u062A\u064E\u0645\u06E1\u0644\u0650\u0643\u064F \u0646\u064E\u0641\u06E1\u0633\u065E \u0644\u0651\u0650\u0646\u064E\u0641\u06E1\u0633\u0656 \u0634\u064E\u064A\u06E1\u0640\u0654\u0657\u0627\u06D6 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0645\u06E1\u0631\u064F \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u0651\u064E\u0647\u0650" }] }, { id: 83, name: "\u0627\u0644\u0645\u0637\u0641\u0641\u064A\u0646", transliteration: "Al-Mutaffifin", type: "meccan", total_verses: 36, verses: [{ id: 1, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0637\u064E\u0641\u0651\u0650\u0641\u0650\u064A\u0646\u064E" }, { id: 2, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0625\u0650\u0630\u064E\u0627 \u0671\u0643\u06E1\u062A\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650 \u064A\u064E\u0633\u06E1\u062A\u064E\u0648\u06E1\u0641\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0643\u064E\u0627\u0644\u064F\u0648\u0647\u064F\u0645\u06E1 \u0623\u064E\u0648 \u0648\u0651\u064E\u0632\u064E\u0646\u064F\u0648\u0647\u064F\u0645\u06E1 \u064A\u064F\u062E\u06E1\u0633\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u0623\u064E\u0644\u064E\u0627 \u064A\u064E\u0638\u064F\u0646\u0651\u064F \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0646\u0651\u064E\u0647\u064F\u0645 \u0645\u0651\u064E\u0628\u06E1\u0639\u064F\u0648\u062B\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0644\u0650\u064A\u064E\u0648\u06E1\u0645\u064D \u0639\u064E\u0638\u0650\u064A\u0645\u0656" }, { id: 6, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0642\u064F\u0648\u0645\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0644\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0639\u064E\u0670\u0644\u064E\u0645\u0650\u064A\u0646\u064E" }, { id: 7, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0671\u0644\u06E1\u0641\u064F\u062C\u0651\u064E\u0627\u0631\u0650 \u0644\u064E\u0641\u0650\u064A \u0633\u0650\u062C\u0651\u0650\u064A\u0646\u0656" }, { id: 8, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u0633\u0650\u062C\u0651\u0650\u064A\u0646\u065E" }, { id: 9, text: "\u0643\u0650\u062A\u064E\u0670\u0628\u065E \u0645\u0651\u064E\u0631\u06E1\u0642\u064F\u0648\u0645\u065E" }, { id: 10, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u0650\u064A\u0646\u064E" }, { id: 11, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E \u0628\u0650\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 12, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F \u0628\u0650\u0647\u0650\u06E6\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0643\u064F\u0644\u0651\u064F \u0645\u064F\u0639\u06E1\u062A\u064E\u062F\u064D \u0623\u064E\u062B\u0650\u064A\u0645\u064D" }, { id: 13, text: "\u0625\u0650\u0630\u064E\u0627 \u062A\u064F\u062A\u06E1\u0644\u064E\u0649\u0670 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0621\u064E\u0627\u064A\u064E\u0670\u062A\u064F\u0646\u064E\u0627 \u0642\u064E\u0627\u0644\u064E \u0623\u064E\u0633\u064E\u0670\u0637\u0650\u064A\u0631\u064F \u0671\u0644\u06E1\u0623\u064E\u0648\u0651\u064E\u0644\u0650\u064A\u0646\u064E" }, { id: 14, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u06D6 \u0628\u064E\u0644\u06E1\u06DC \u0631\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0642\u064F\u0644\u064F\u0648\u0628\u0650\u0647\u0650\u0645 \u0645\u0651\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0643\u06E1\u0633\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 15, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0631\u0651\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u064E\u0645\u064E\u062D\u06E1\u062C\u064F\u0648\u0628\u064F\u0648\u0646\u064E" }, { id: 16, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0635\u064E\u0627\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u0650" }, { id: 17, text: "\u062B\u064F\u0645\u0651\u064E \u064A\u064F\u0642\u064E\u0627\u0644\u064F \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064F\u0646\u062A\u064F\u0645 \u0628\u0650\u0647\u0650\u06E6 \u062A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 18, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0631\u064E\u0627\u0631\u0650 \u0644\u064E\u0641\u0650\u064A \u0639\u0650\u0644\u0651\u0650\u064A\u0651\u0650\u064A\u0646\u064E" }, { id: 19, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u0639\u0650\u0644\u0651\u0650\u064A\u0651\u064F\u0648\u0646\u064E" }, { id: 20, text: "\u0643\u0650\u062A\u064E\u0670\u0628\u065E \u0645\u0651\u064E\u0631\u06E1\u0642\u064F\u0648\u0645\u065E" }, { id: 21, text: "\u064A\u064E\u0634\u06E1\u0647\u064E\u062F\u064F\u0647\u064F \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0631\u0651\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 22, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u0631\u064E\u0627\u0631\u064E \u0644\u064E\u0641\u0650\u064A \u0646\u064E\u0639\u0650\u064A\u0645\u064D" }, { id: 23, text: "\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0643\u0650 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u062A\u064E\u0639\u06E1\u0631\u0650\u0641\u064F \u0641\u0650\u064A \u0648\u064F\u062C\u064F\u0648\u0647\u0650\u0647\u0650\u0645\u06E1 \u0646\u064E\u0636\u06E1\u0631\u064E\u0629\u064E \u0671\u0644\u0646\u0651\u064E\u0639\u0650\u064A\u0645\u0650" }, { id: 25, text: "\u064A\u064F\u0633\u06E1\u0642\u064E\u0648\u06E1\u0646\u064E \u0645\u0650\u0646 \u0631\u0651\u064E\u062D\u0650\u064A\u0642\u0656 \u0645\u0651\u064E\u062E\u06E1\u062A\u064F\u0648\u0645\u064D" }, { id: 26, text: "\u062E\u0650\u062A\u064E\u0670\u0645\u064F\u0647\u064F\u06E5 \u0645\u0650\u0633\u06E1\u0643\u065E\u06DA \u0648\u064E\u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0641\u064E\u0644\u06E1\u064A\u064E\u062A\u064E\u0646\u064E\u0627\u0641\u064E\u0633\u0650 \u0671\u0644\u06E1\u0645\u064F\u062A\u064E\u0646\u064E\u0670\u0641\u0650\u0633\u064F\u0648\u0646\u064E" }, { id: 27, text: "\u0648\u064E\u0645\u0650\u0632\u064E\u0627\u062C\u064F\u0647\u064F\u06E5 \u0645\u0650\u0646 \u062A\u064E\u0633\u06E1\u0646\u0650\u064A\u0645\u064D" }, { id: 28, text: "\u0639\u064E\u064A\u06E1\u0646\u0657\u0627 \u064A\u064E\u0634\u06E1\u0631\u064E\u0628\u064F \u0628\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0645\u064F\u0642\u064E\u0631\u0651\u064E\u0628\u064F\u0648\u0646\u064E" }, { id: 29, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064E\u062C\u06E1\u0631\u064E\u0645\u064F\u0648\u0627\u0652 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0636\u06E1\u062D\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 30, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0631\u0651\u064F\u0648\u0627\u0652 \u0628\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u062A\u064E\u063A\u064E\u0627\u0645\u064E\u0632\u064F\u0648\u0646\u064E" }, { id: 31, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0646\u0642\u064E\u0644\u064E\u0628\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u0645\u064F \u0671\u0646\u0642\u064E\u0644\u064E\u0628\u064F\u0648\u0627\u0652 \u0641\u064E\u0643\u0650\u0647\u0650\u064A\u0646\u064E" }, { id: 32, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0631\u064E\u0623\u064E\u0648\u06E1\u0647\u064F\u0645\u06E1 \u0642\u064E\u0627\u0644\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0640\u0670\u0653\u0624\u064F\u0644\u064E\u0627\u0653\u0621\u0650 \u0644\u064E\u0636\u064E\u0627\u0653\u0644\u0651\u064F\u0648\u0646\u064E" }, { id: 33, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0631\u06E1\u0633\u0650\u0644\u064F\u0648\u0627\u0652 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u062D\u064E\u0670\u0641\u0650\u0638\u0650\u064A\u0646\u064E" }, { id: 34, text: "\u0641\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u0650 \u064A\u064E\u0636\u06E1\u062D\u064E\u0643\u064F\u0648\u0646\u064E" }, { id: 35, text: "\u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0643\u0650 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E" }, { id: 36, text: "\u0647\u064E\u0644\u06E1 \u062B\u064F\u0648\u0651\u0650\u0628\u064E \u0671\u0644\u06E1\u0643\u064F\u0641\u0651\u064E\u0627\u0631\u064F \u0645\u064E\u0627 \u0643\u064E\u0627\u0646\u064F\u0648\u0627\u0652 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E" }] }, { id: 84, name: "\u0627\u0644\u0625\u0646\u0634\u0642\u0627\u0642", transliteration: "Al-Inshiqaq", type: "meccan", total_verses: 25, verses: [{ id: 1, text: "\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u064F \u0671\u0646\u0634\u064E\u0642\u0651\u064E\u062A\u06E1" }, { id: 2, text: "\u0648\u064E\u0623\u064E\u0630\u0650\u0646\u064E\u062A\u06E1 \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u064E\u0627 \u0648\u064E\u062D\u064F\u0642\u0651\u064E\u062A\u06E1" }, { id: 3, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0645\u064F\u062F\u0651\u064E\u062A\u06E1" }, { id: 4, text: "\u0648\u064E\u0623\u064E\u0644\u06E1\u0642\u064E\u062A\u06E1 \u0645\u064E\u0627 \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u062A\u064E\u062E\u064E\u0644\u0651\u064E\u062A\u06E1" }, { id: 5, text: "\u0648\u064E\u0623\u064E\u0630\u0650\u0646\u064E\u062A\u06E1 \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u064E\u0627 \u0648\u064E\u062D\u064F\u0642\u0651\u064E\u062A\u06E1" }, { id: 6, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0625\u0650\u0646\u0651\u064E\u0643\u064E \u0643\u064E\u0627\u062F\u0650\u062D\u064C \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0643\u064E\u062F\u06E1\u062D\u0657\u0627 \u0641\u064E\u0645\u064F\u0644\u064E\u0670\u0642\u0650\u064A\u0647\u0650" }, { id: 7, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u064E\u0647\u064F\u06E5 \u0628\u0650\u064A\u064E\u0645\u0650\u064A\u0646\u0650\u0647\u0650\u06E6" }, { id: 8, text: "\u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064F\u062D\u064E\u0627\u0633\u064E\u0628\u064F \u062D\u0650\u0633\u064E\u0627\u0628\u0657\u0627 \u064A\u064E\u0633\u0650\u064A\u0631\u0657\u0627" }, { id: 9, text: "\u0648\u064E\u064A\u064E\u0646\u0642\u064E\u0644\u0650\u0628\u064F \u0625\u0650\u0644\u064E\u0649\u0670\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0645\u064E\u0633\u06E1\u0631\u064F\u0648\u0631\u0657\u0627" }, { id: 10, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0623\u064F\u0648\u062A\u0650\u064A\u064E \u0643\u0650\u062A\u064E\u0670\u0628\u064E\u0647\u064F\u06E5 \u0648\u064E\u0631\u064E\u0627\u0653\u0621\u064E \u0638\u064E\u0647\u06E1\u0631\u0650\u0647\u0650\u06E6" }, { id: 11, text: "\u0641\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u062F\u06E1\u0639\u064F\u0648\u0627\u0652 \u062B\u064F\u0628\u064F\u0648\u0631\u0657\u0627" }, { id: 12, text: "\u0648\u064E\u064A\u064E\u0635\u06E1\u0644\u064E\u0649\u0670 \u0633\u064E\u0639\u0650\u064A\u0631\u064B\u0627" }, { id: 13, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u0647\u06E1\u0644\u0650\u0647\u0650\u06E6 \u0645\u064E\u0633\u06E1\u0631\u064F\u0648\u0631\u064B\u0627" }, { id: 14, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0638\u064E\u0646\u0651\u064E \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u064A\u064E\u062D\u064F\u0648\u0631\u064E" }, { id: 15, text: "\u0628\u064E\u0644\u064E\u0649\u0670\u0653\u06DA \u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0628\u064E\u0635\u0650\u064A\u0631\u0657\u0627" }, { id: 16, text: "\u0641\u064E\u0644\u064E\u0627\u0653 \u0623\u064F\u0642\u06E1\u0633\u0650\u0645\u064F \u0628\u0650\u0671\u0644\u0634\u0651\u064E\u0641\u064E\u0642\u0650" }, { id: 17, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0648\u064E\u0645\u064E\u0627 \u0648\u064E\u0633\u064E\u0642\u064E" }, { id: 18, text: "\u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u0650 \u0625\u0650\u0630\u064E\u0627 \u0671\u062A\u0651\u064E\u0633\u064E\u0642\u064E" }, { id: 19, text: "\u0644\u064E\u062A\u064E\u0631\u06E1\u0643\u064E\u0628\u064F\u0646\u0651\u064E \u0637\u064E\u0628\u064E\u0642\u064B\u0627 \u0639\u064E\u0646 \u0637\u064E\u0628\u064E\u0642\u0656" }, { id: 20, text: "\u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0644\u064E\u0627 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0646\u064E" }, { id: 21, text: "\u0648\u064E\u0625\u0650\u0630\u064E\u0627 \u0642\u064F\u0631\u0650\u0626\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u064F \u0671\u0644\u06E1\u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u064F \u0644\u064E\u0627 \u064A\u064E\u0633\u06E1\u062C\u064F\u062F\u064F\u0648\u0646\u064E\u06E4\u06E9" }, { id: 22, text: "\u0628\u064E\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0648\u0646\u064E" }, { id: 23, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0628\u0650\u0645\u064E\u0627 \u064A\u064F\u0648\u0639\u064F\u0648\u0646\u064E" }, { id: 24, text: "\u0641\u064E\u0628\u064E\u0634\u0651\u0650\u0631\u06E1\u0647\u064F\u0645 \u0628\u0650\u0639\u064E\u0630\u064E\u0627\u0628\u064D \u0623\u064E\u0644\u0650\u064A\u0645\u064D" }, { id: 25, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064E\u0645\u06E1\u0646\u064F\u0648\u0646\u0650\u06ED" }] }, { id: 85, name: "\u0627\u0644\u0628\u0631\u0648\u062C", transliteration: "Al-Buruj", type: "meccan", total_verses: 22, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u06E1\u0628\u064F\u0631\u064F\u0648\u062C\u0650" }, { id: 2, text: "\u0648\u064E\u0671\u0644\u06E1\u064A\u064E\u0648\u06E1\u0645\u0650 \u0671\u0644\u06E1\u0645\u064E\u0648\u06E1\u0639\u064F\u0648\u062F\u0650" }, { id: 3, text: "\u0648\u064E\u0634\u064E\u0627\u0647\u0650\u062F\u0656 \u0648\u064E\u0645\u064E\u0634\u06E1\u0647\u064F\u0648\u062F\u0656" }, { id: 4, text: "\u0642\u064F\u062A\u0650\u0644\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u0623\u064F\u062E\u06E1\u062F\u064F\u0648\u062F\u0650" }, { id: 5, text: "\u0671\u0644\u0646\u0651\u064E\u0627\u0631\u0650 \u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u06E1\u0648\u064E\u0642\u064F\u0648\u062F\u0650" }, { id: 6, text: "\u0625\u0650\u0630\u06E1 \u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u0642\u064F\u0639\u064F\u0648\u062F\u065E" }, { id: 7, text: "\u0648\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0644\u064E\u0649\u0670 \u0645\u064E\u0627 \u064A\u064E\u0641\u06E1\u0639\u064E\u0644\u064F\u0648\u0646\u064E \u0628\u0650\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0634\u064F\u0647\u064F\u0648\u062F\u065E" }, { id: 8, text: "\u0648\u064E\u0645\u064E\u0627 \u0646\u064E\u0642\u064E\u0645\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0625\u0650\u0644\u0651\u064E\u0627\u0653 \u0623\u064E\u0646 \u064A\u064F\u0624\u06E1\u0645\u0650\u0646\u064F\u0648\u0627\u0652 \u0628\u0650\u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0639\u064E\u0632\u0650\u064A\u0632\u0650 \u0671\u0644\u06E1\u062D\u064E\u0645\u0650\u064A\u062F\u0650" }, { id: 9, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0644\u064E\u0647\u064F\u06E5 \u0645\u064F\u0644\u06E1\u0643\u064F \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0670\u0648\u064E\u0670\u062A\u0650 \u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650\u06DA \u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0643\u064F\u0644\u0651\u0650 \u0634\u064E\u064A\u06E1\u0621\u0656 \u0634\u064E\u0647\u0650\u064A\u062F\u064C" }, { id: 10, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0641\u064E\u062A\u064E\u0646\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u0650\u064A\u0646\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0624\u06E1\u0645\u0650\u0646\u064E\u0670\u062A\u0650 \u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0645\u06E1 \u064A\u064E\u062A\u064F\u0648\u0628\u064F\u0648\u0627\u0652 \u0641\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064F \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u0648\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0639\u064E\u0630\u064E\u0627\u0628\u064F \u0671\u0644\u06E1\u062D\u064E\u0631\u0650\u064A\u0642\u0650" }, { id: 11, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0644\u064E\u0647\u064F\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u065E \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u06E1\u0641\u064E\u0648\u06E1\u0632\u064F \u0671\u0644\u06E1\u0643\u064E\u0628\u0650\u064A\u0631\u064F" }, { id: 12, text: "\u0625\u0650\u0646\u0651\u064E \u0628\u064E\u0637\u06E1\u0634\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0644\u064E\u0634\u064E\u062F\u0650\u064A\u062F\u064C" }, { id: 13, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0647\u064F\u0648\u064E \u064A\u064F\u0628\u06E1\u062F\u0650\u0626\u064F \u0648\u064E\u064A\u064F\u0639\u0650\u064A\u062F\u064F" }, { id: 14, text: "\u0648\u064E\u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u063A\u064E\u0641\u064F\u0648\u0631\u064F \u0671\u0644\u06E1\u0648\u064E\u062F\u064F\u0648\u062F\u064F" }, { id: 15, text: "\u0630\u064F\u0648 \u0671\u0644\u06E1\u0639\u064E\u0631\u06E1\u0634\u0650 \u0671\u0644\u06E1\u0645\u064E\u062C\u0650\u064A\u062F\u064F" }, { id: 16, text: "\u0641\u064E\u0639\u0651\u064E\u0627\u0644\u065E \u0644\u0651\u0650\u0645\u064E\u0627 \u064A\u064F\u0631\u0650\u064A\u062F\u064F" }, { id: 17, text: "\u0647\u064E\u0644\u06E1 \u0623\u064E\u062A\u064E\u0649\u0670\u0643\u064E \u062D\u064E\u062F\u0650\u064A\u062B\u064F \u0671\u0644\u06E1\u062C\u064F\u0646\u064F\u0648\u062F\u0650" }, { id: 18, text: "\u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064E" }, { id: 19, text: "\u0628\u064E\u0644\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A \u062A\u064E\u0643\u06E1\u0630\u0650\u064A\u0628\u0656" }, { id: 20, text: "\u0648\u064E\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0645\u0650\u0646 \u0648\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0647\u0650\u0645 \u0645\u0651\u064F\u062D\u0650\u064A\u0637\u064F\u06E2" }, { id: 21, text: "\u0628\u064E\u0644\u06E1 \u0647\u064F\u0648\u064E \u0642\u064F\u0631\u06E1\u0621\u064E\u0627\u0646\u065E \u0645\u0651\u064E\u062C\u0650\u064A\u062F\u065E" }, { id: 22, text: "\u0641\u0650\u064A \u0644\u064E\u0648\u06E1\u062D\u0656 \u0645\u0651\u064E\u062D\u06E1\u0641\u064F\u0648\u0638\u0650\u06ED" }] }, { id: 86, name: "\u0627\u0644\u0637\u0627\u0631\u0642", transliteration: "At-Tariq", type: "meccan", total_verses: 17, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u0637\u0651\u064E\u0627\u0631\u0650\u0642\u0650" }, { id: 2, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u0671\u0644\u0637\u0651\u064E\u0627\u0631\u0650\u0642\u064F" }, { id: 3, text: "\u0671\u0644\u0646\u0651\u064E\u062C\u06E1\u0645\u064F \u0671\u0644\u062B\u0651\u064E\u0627\u0642\u0650\u0628\u064F" }, { id: 4, text: "\u0625\u0650\u0646 \u0643\u064F\u0644\u0651\u064F \u0646\u064E\u0641\u06E1\u0633\u0656 \u0644\u0651\u064E\u0645\u0651\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u064E\u0627 \u062D\u064E\u0627\u0641\u0650\u0638\u065E" }, { id: 5, text: "\u0641\u064E\u0644\u06E1\u064A\u064E\u0646\u0638\u064F\u0631\u0650 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0645\u0650\u0645\u0651\u064E \u062E\u064F\u0644\u0650\u0642\u064E" }, { id: 6, text: "\u062E\u064F\u0644\u0650\u0642\u064E \u0645\u0650\u0646 \u0645\u0651\u064E\u0627\u0653\u0621\u0656 \u062F\u064E\u0627\u0641\u0650\u0642\u0656" }, { id: 7, text: "\u064A\u064E\u062E\u06E1\u0631\u064F\u062C\u064F \u0645\u0650\u0646\u06E2 \u0628\u064E\u064A\u06E1\u0646\u0650 \u0671\u0644\u0635\u0651\u064F\u0644\u06E1\u0628\u0650 \u0648\u064E\u0671\u0644\u062A\u0651\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0628\u0650" }, { id: 8, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0631\u064E\u062C\u06E1\u0639\u0650\u0647\u0650\u06E6 \u0644\u064E\u0642\u064E\u0627\u062F\u0650\u0631\u065E" }, { id: 9, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u062A\u064F\u0628\u06E1\u0644\u064E\u0649 \u0671\u0644\u0633\u0651\u064E\u0631\u064E\u0627\u0653\u0626\u0650\u0631\u064F" }, { id: 10, text: "\u0641\u064E\u0645\u064E\u0627 \u0644\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0642\u064F\u0648\u0651\u064E\u0629\u0656 \u0648\u064E\u0644\u064E\u0627 \u0646\u064E\u0627\u0635\u0650\u0631\u0656" }, { id: 11, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0631\u0651\u064E\u062C\u06E1\u0639\u0650" }, { id: 12, text: "\u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u0635\u0651\u064E\u062F\u06E1\u0639\u0650" }, { id: 13, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u064E\u0642\u064E\u0648\u06E1\u0644\u065E \u0641\u064E\u0635\u06E1\u0644\u065E" }, { id: 14, text: "\u0648\u064E\u0645\u064E\u0627 \u0647\u064F\u0648\u064E \u0628\u0650\u0671\u0644\u06E1\u0647\u064E\u0632\u06E1\u0644\u0650" }, { id: 15, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u0645\u06E1 \u064A\u064E\u0643\u0650\u064A\u062F\u064F\u0648\u0646\u064E \u0643\u064E\u064A\u06E1\u062F\u0657\u0627" }, { id: 16, text: "\u0648\u064E\u0623\u064E\u0643\u0650\u064A\u062F\u064F \u0643\u064E\u064A\u06E1\u062F\u0657\u0627" }, { id: 17, text: "\u0641\u064E\u0645\u064E\u0647\u0651\u0650\u0644\u0650 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u0650\u064A\u0646\u064E \u0623\u064E\u0645\u06E1\u0647\u0650\u0644\u06E1\u0647\u064F\u0645\u06E1 \u0631\u064F\u0648\u064E\u064A\u06E1\u062F\u064E\u06E2\u0627" }] }, { id: 87, name: "\u0627\u0644\u0623\u0639\u0644\u0649", transliteration: "Al-A'la", type: "meccan", total_verses: 19, verses: [{ id: 1, text: "\u0633\u064E\u0628\u0651\u0650\u062D\u0650 \u0671\u0633\u06E1\u0645\u064E \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0649" }, { id: 2, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E \u0641\u064E\u0633\u064E\u0648\u0651\u064E\u0649\u0670" }, { id: 3, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0642\u064E\u062F\u0651\u064E\u0631\u064E \u0641\u064E\u0647\u064E\u062F\u064E\u0649\u0670" }, { id: 4, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E \u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u0639\u064E\u0649\u0670" }, { id: 5, text: "\u0641\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u06E5 \u063A\u064F\u062B\u064E\u0627\u0653\u0621\u064B \u0623\u064E\u062D\u06E1\u0648\u064E\u0649\u0670" }, { id: 6, text: "\u0633\u064E\u0646\u064F\u0642\u06E1\u0631\u0650\u0626\u064F\u0643\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u0633\u064E\u0649\u0670\u0653" }, { id: 7, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0627 \u0634\u064E\u0627\u0653\u0621\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0671\u0644\u06E1\u062C\u064E\u0647\u06E1\u0631\u064E \u0648\u064E\u0645\u064E\u0627 \u064A\u064E\u062E\u06E1\u0641\u064E\u0649\u0670" }, { id: 8, text: "\u0648\u064E\u0646\u064F\u064A\u064E\u0633\u0651\u0650\u0631\u064F\u0643\u064E \u0644\u0650\u0644\u06E1\u064A\u064F\u0633\u06E1\u0631\u064E\u0649\u0670" }, { id: 9, text: "\u0641\u064E\u0630\u064E\u0643\u0651\u0650\u0631\u06E1 \u0625\u0650\u0646 \u0646\u0651\u064E\u0641\u064E\u0639\u064E\u062A\u0650 \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E\u0649\u0670" }, { id: 10, text: "\u0633\u064E\u064A\u064E\u0630\u0651\u064E\u0643\u0651\u064E\u0631\u064F \u0645\u064E\u0646 \u064A\u064E\u062E\u06E1\u0634\u064E\u0649\u0670" }, { id: 11, text: "\u0648\u064E\u064A\u064E\u062A\u064E\u062C\u064E\u0646\u0651\u064E\u0628\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0634\u06E1\u0642\u064E\u0649" }, { id: 12, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0635\u06E1\u0644\u064E\u0649 \u0671\u0644\u0646\u0651\u064E\u0627\u0631\u064E \u0671\u0644\u06E1\u0643\u064F\u0628\u06E1\u0631\u064E\u0649\u0670" }, { id: 13, text: "\u062B\u064F\u0645\u0651\u064E \u0644\u064E\u0627 \u064A\u064E\u0645\u064F\u0648\u062A\u064F \u0641\u0650\u064A\u0647\u064E\u0627 \u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u06E1\u064A\u064E\u0649\u0670" }, { id: 14, text: "\u0642\u064E\u062F\u06E1 \u0623\u064E\u0641\u06E1\u0644\u064E\u062D\u064E \u0645\u064E\u0646 \u062A\u064E\u0632\u064E\u0643\u0651\u064E\u0649\u0670" }, { id: 15, text: "\u0648\u064E\u0630\u064E\u0643\u064E\u0631\u064E \u0671\u0633\u06E1\u0645\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0641\u064E\u0635\u064E\u0644\u0651\u064E\u0649\u0670" }, { id: 16, text: "\u0628\u064E\u0644\u06E1 \u062A\u064F\u0624\u06E1\u062B\u0650\u0631\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u062D\u064E\u064A\u064E\u0648\u0670\u0629\u064E \u0671\u0644\u062F\u0651\u064F\u0646\u06E1\u064A\u064E\u0627" }, { id: 17, text: "\u0648\u064E\u0671\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064F \u062E\u064E\u064A\u06E1\u0631\u065E \u0648\u064E\u0623\u064E\u0628\u06E1\u0642\u064E\u0649\u0670\u0653" }, { id: 18, text: "\u0625\u0650\u0646\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0644\u064E\u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u062D\u064F\u0641\u0650 \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670" }, { id: 19, text: "\u0635\u064F\u062D\u064F\u0641\u0650 \u0625\u0650\u0628\u06E1\u0631\u064E\u0670\u0647\u0650\u064A\u0645\u064E \u0648\u064E\u0645\u064F\u0648\u0633\u064E\u0649\u0670" }] }, { id: 88, name: "\u0627\u0644\u063A\u0627\u0634\u064A\u0629", transliteration: "Al-Ghashiyah", type: "meccan", total_verses: 26, verses: [{ id: 1, text: "\u0647\u064E\u0644\u06E1 \u0623\u064E\u062A\u064E\u0649\u0670\u0643\u064E \u062D\u064E\u062F\u0650\u064A\u062B\u064F \u0671\u0644\u06E1\u063A\u064E\u0670\u0634\u0650\u064A\u064E\u0629\u0650" }, { id: 2, text: "\u0648\u064F\u062C\u064F\u0648\u0647\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u062E\u064E\u0670\u0634\u0650\u0639\u064E\u0629\u064C" }, { id: 3, text: "\u0639\u064E\u0627\u0645\u0650\u0644\u064E\u0629\u065E \u0646\u0651\u064E\u0627\u0635\u0650\u0628\u064E\u0629\u065E" }, { id: 4, text: "\u062A\u064E\u0635\u06E1\u0644\u064E\u0649\u0670 \u0646\u064E\u0627\u0631\u064B\u0627 \u062D\u064E\u0627\u0645\u0650\u064A\u064E\u0629\u0657" }, { id: 5, text: "\u062A\u064F\u0633\u06E1\u0642\u064E\u0649\u0670 \u0645\u0650\u0646\u06E1 \u0639\u064E\u064A\u06E1\u0646\u064D \u0621\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u0656" }, { id: 6, text: "\u0644\u0651\u064E\u064A\u06E1\u0633\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0637\u064E\u0639\u064E\u0627\u0645\u064C \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646 \u0636\u064E\u0631\u0650\u064A\u0639\u0656" }, { id: 7, text: "\u0644\u0651\u064E\u0627 \u064A\u064F\u0633\u06E1\u0645\u0650\u0646\u064F \u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A \u0645\u0650\u0646 \u062C\u064F\u0648\u0639\u0656" }, { id: 8, text: "\u0648\u064F\u062C\u064F\u0648\u0647\u065E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0646\u0651\u064E\u0627\u0639\u0650\u0645\u064E\u0629\u065E" }, { id: 9, text: "\u0644\u0651\u0650\u0633\u064E\u0639\u06E1\u064A\u0650\u0647\u064E\u0627 \u0631\u064E\u0627\u0636\u0650\u064A\u064E\u0629\u065E" }, { id: 10, text: "\u0641\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u0629\u064D \u0639\u064E\u0627\u0644\u0650\u064A\u064E\u0629\u0656" }, { id: 11, text: "\u0644\u0651\u064E\u0627 \u062A\u064E\u0633\u06E1\u0645\u064E\u0639\u064F \u0641\u0650\u064A\u0647\u064E\u0627 \u0644\u064E\u0670\u063A\u0650\u064A\u064E\u0629\u0657" }, { id: 12, text: "\u0641\u0650\u064A\u0647\u064E\u0627 \u0639\u064E\u064A\u06E1\u0646\u065E \u062C\u064E\u0627\u0631\u0650\u064A\u064E\u0629\u065E" }, { id: 13, text: "\u0641\u0650\u064A\u0647\u064E\u0627 \u0633\u064F\u0631\u064F\u0631\u065E \u0645\u0651\u064E\u0631\u06E1\u0641\u064F\u0648\u0639\u064E\u0629\u065E" }, { id: 14, text: "\u0648\u064E\u0623\u064E\u0643\u06E1\u0648\u064E\u0627\u0628\u065E \u0645\u0651\u064E\u0648\u06E1\u0636\u064F\u0648\u0639\u064E\u0629\u065E" }, { id: 15, text: "\u0648\u064E\u0646\u064E\u0645\u064E\u0627\u0631\u0650\u0642\u064F \u0645\u064E\u0635\u06E1\u0641\u064F\u0648\u0641\u064E\u0629\u065E" }, { id: 16, text: "\u0648\u064E\u0632\u064E\u0631\u064E\u0627\u0628\u0650\u064A\u0651\u064F \u0645\u064E\u0628\u06E1\u062B\u064F\u0648\u062B\u064E\u0629\u064C" }, { id: 17, text: "\u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0646\u0638\u064F\u0631\u064F\u0648\u0646\u064E \u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0625\u0650\u0628\u0650\u0644\u0650 \u0643\u064E\u064A\u06E1\u0641\u064E \u062E\u064F\u0644\u0650\u0642\u064E\u062A\u06E1" }, { id: 18, text: "\u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0643\u064E\u064A\u06E1\u0641\u064E \u0631\u064F\u0641\u0650\u0639\u064E\u062A\u06E1" }, { id: 19, text: "\u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u0650 \u0643\u064E\u064A\u06E1\u0641\u064E \u0646\u064F\u0635\u0650\u0628\u064E\u062A\u06E1" }, { id: 20, text: "\u0648\u064E\u0625\u0650\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0643\u064E\u064A\u06E1\u0641\u064E \u0633\u064F\u0637\u0650\u062D\u064E\u062A\u06E1" }, { id: 21, text: "\u0641\u064E\u0630\u064E\u0643\u0651\u0650\u0631\u06E1 \u0625\u0650\u0646\u0651\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064E \u0645\u064F\u0630\u064E\u0643\u0651\u0650\u0631\u065E" }, { id: 22, text: "\u0644\u0651\u064E\u0633\u06E1\u062A\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0628\u0650\u0645\u064F\u0635\u064E\u064A\u06E1\u0637\u0650\u0631\u064D" }, { id: 23, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u064E\u0646 \u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670 \u0648\u064E\u0643\u064E\u0641\u064E\u0631\u064E" }, { id: 24, text: "\u0641\u064E\u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F\u0647\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u06E1\u0639\u064E\u0630\u064E\u0627\u0628\u064E \u0671\u0644\u06E1\u0623\u064E\u0643\u06E1\u0628\u064E\u0631\u064E" }, { id: 25, text: "\u0625\u0650\u0646\u0651\u064E \u0625\u0650\u0644\u064E\u064A\u06E1\u0646\u064E\u0627\u0653 \u0625\u0650\u064A\u064E\u0627\u0628\u064E\u0647\u064F\u0645\u06E1" }, { id: 26, text: "\u062B\u064F\u0645\u0651\u064E \u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u062D\u0650\u0633\u064E\u0627\u0628\u064E\u0647\u064F\u0645" }] }, { id: 89, name: "\u0627\u0644\u0641\u062C\u0631", transliteration: "Al-Fajr", type: "meccan", total_verses: 30, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u06E1\u0641\u064E\u062C\u06E1\u0631\u0650" }, { id: 2, text: "\u0648\u064E\u0644\u064E\u064A\u064E\u0627\u0644\u064D \u0639\u064E\u0634\u06E1\u0631\u0656" }, { id: 3, text: "\u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0641\u06E1\u0639\u0650 \u0648\u064E\u0671\u0644\u06E1\u0648\u064E\u062A\u06E1\u0631\u0650" }, { id: 4, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0625\u0650\u0630\u064E\u0627 \u064A\u064E\u0633\u06E1\u0631\u0650" }, { id: 5, text: "\u0647\u064E\u0644\u06E1 \u0641\u0650\u064A \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0642\u064E\u0633\u064E\u0645\u065E \u0644\u0651\u0650\u0630\u0650\u064A \u062D\u0650\u062C\u06E1\u0631\u064D" }, { id: 6, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0643\u064E\u064A\u06E1\u0641\u064E \u0641\u064E\u0639\u064E\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0628\u0650\u0639\u064E\u0627\u062F\u064D" }, { id: 7, text: "\u0625\u0650\u0631\u064E\u0645\u064E \u0630\u064E\u0627\u062A\u0650 \u0671\u0644\u06E1\u0639\u0650\u0645\u064E\u0627\u062F\u0650" }, { id: 8, text: "\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u0644\u064E\u0645\u06E1 \u064A\u064F\u062E\u06E1\u0644\u064E\u0642\u06E1 \u0645\u0650\u062B\u06E1\u0644\u064F\u0647\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u0650\u0644\u064E\u0670\u062F\u0650" }, { id: 9, text: "\u0648\u064E\u062B\u064E\u0645\u064F\u0648\u062F\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u062C\u064E\u0627\u0628\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u062E\u06E1\u0631\u064E \u0628\u0650\u0671\u0644\u06E1\u0648\u064E\u0627\u062F\u0650" }, { id: 10, text: "\u0648\u064E\u0641\u0650\u0631\u06E1\u0639\u064E\u0648\u06E1\u0646\u064E \u0630\u0650\u064A \u0671\u0644\u06E1\u0623\u064E\u0648\u06E1\u062A\u064E\u0627\u062F\u0650" }, { id: 11, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0637\u064E\u063A\u064E\u0648\u06E1\u0627\u0652 \u0641\u0650\u064A \u0671\u0644\u06E1\u0628\u0650\u0644\u064E\u0670\u062F\u0650" }, { id: 12, text: "\u0641\u064E\u0623\u064E\u0643\u06E1\u062B\u064E\u0631\u064F\u0648\u0627\u0652 \u0641\u0650\u064A\u0647\u064E\u0627 \u0671\u0644\u06E1\u0641\u064E\u0633\u064E\u0627\u062F\u064E" }, { id: 13, text: "\u0641\u064E\u0635\u064E\u0628\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0633\u064E\u0648\u06E1\u0637\u064E \u0639\u064E\u0630\u064E\u0627\u0628\u064D" }, { id: 14, text: "\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0644\u064E\u0628\u0650\u0671\u0644\u06E1\u0645\u0650\u0631\u06E1\u0635\u064E\u0627\u062F\u0650" }, { id: 15, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627 \u0671\u0628\u06E1\u062A\u064E\u0644\u064E\u0649\u0670\u0647\u064F \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u06E5 \u0641\u064E\u0623\u064E\u0643\u06E1\u0631\u064E\u0645\u064E\u0647\u064F\u06E5 \u0648\u064E\u0646\u064E\u0639\u0651\u064E\u0645\u064E\u0647\u064F\u06E5 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u0643\u06E1\u0631\u064E\u0645\u064E\u0646\u0650" }, { id: 16, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627\u0653 \u0625\u0650\u0630\u064E\u0627 \u0645\u064E\u0627 \u0671\u0628\u06E1\u062A\u064E\u0644\u064E\u0649\u0670\u0647\u064F \u0641\u064E\u0642\u064E\u062F\u064E\u0631\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0631\u0650\u0632\u06E1\u0642\u064E\u0647\u064F\u06E5 \u0641\u064E\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0631\u064E\u0628\u0651\u0650\u064A\u0653 \u0623\u064E\u0647\u064E\u0670\u0646\u064E\u0646\u0650" }, { id: 17, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u06D6 \u0628\u064E\u0644 \u0644\u0651\u064E\u0627 \u062A\u064F\u0643\u06E1\u0631\u0650\u0645\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u064A\u064E\u062A\u0650\u064A\u0645\u064E" }, { id: 18, text: "\u0648\u064E\u0644\u064E\u0627 \u062A\u064E\u062D\u064E\u0640\u0670\u0653\u0636\u0651\u064F\u0648\u0646\u064E \u0639\u064E\u0644\u064E\u0649\u0670 \u0637\u064E\u0639\u064E\u0627\u0645\u0650 \u0671\u0644\u06E1\u0645\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u0650" }, { id: 19, text: "\u0648\u064E\u062A\u064E\u0623\u06E1\u0643\u064F\u0644\u064F\u0648\u0646\u064E \u0671\u0644\u062A\u0651\u064F\u0631\u064E\u0627\u062B\u064E \u0623\u064E\u0643\u06E1\u0644\u0657\u0627 \u0644\u0651\u064E\u0645\u0651\u0657\u0627" }, { id: 20, text: "\u0648\u064E\u062A\u064F\u062D\u0650\u0628\u0651\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0627\u0644\u064E \u062D\u064F\u0628\u0651\u0657\u0627 \u062C\u064E\u0645\u0651\u0657\u0627" }, { id: 21, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653\u06D6 \u0625\u0650\u0630\u064E\u0627 \u062F\u064F\u0643\u0651\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u062F\u064E\u0643\u0651\u0657\u0627 \u062F\u064E\u0643\u0651\u0657\u0627" }, { id: 22, text: "\u0648\u064E\u062C\u064E\u0627\u0653\u0621\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0648\u064E\u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0643\u064F \u0635\u064E\u0641\u0651\u0657\u0627 \u0635\u064E\u0641\u0651\u0657\u0627" }, { id: 23, text: "\u0648\u064E\u062C\u0650\u0627\u0652\u064A\u0653\u0621\u064E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0650\u06ED \u0628\u0650\u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E\u06DA \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064E\u062A\u064E\u0630\u064E\u0643\u0651\u064E\u0631\u064F \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0648\u064E\u0623\u064E\u0646\u0651\u064E\u0649\u0670 \u0644\u064E\u0647\u064F \u0671\u0644\u0630\u0651\u0650\u0643\u06E1\u0631\u064E\u0649\u0670" }, { id: 24, text: "\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u064A\u064E\u0670\u0644\u064E\u064A\u06E1\u062A\u064E\u0646\u0650\u064A \u0642\u064E\u062F\u0651\u064E\u0645\u06E1\u062A\u064F \u0644\u0650\u062D\u064E\u064A\u064E\u0627\u062A\u0650\u064A" }, { id: 25, text: "\u0641\u064E\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u064E\u0627 \u064A\u064F\u0639\u064E\u0630\u0651\u0650\u0628\u064F \u0639\u064E\u0630\u064E\u0627\u0628\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062D\u064E\u062F\u065E" }, { id: 26, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064F\u0648\u062B\u0650\u0642\u064F \u0648\u064E\u062B\u064E\u0627\u0642\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062D\u064E\u062F\u065E" }, { id: 27, text: "\u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064E\u062A\u064F\u0647\u064E\u0627 \u0671\u0644\u0646\u0651\u064E\u0641\u06E1\u0633\u064F \u0671\u0644\u06E1\u0645\u064F\u0637\u06E1\u0645\u064E\u0626\u0650\u0646\u0651\u064E\u0629\u064F" }, { id: 28, text: "\u0671\u0631\u06E1\u062C\u0650\u0639\u0650\u064A\u0653 \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u0650 \u0631\u064E\u0627\u0636\u0650\u064A\u064E\u0629\u0657 \u0645\u0651\u064E\u0631\u06E1\u0636\u0650\u064A\u0651\u064E\u0629\u0657" }, { id: 29, text: "\u0641\u064E\u0671\u062F\u06E1\u062E\u064F\u0644\u0650\u064A \u0641\u0650\u064A \u0639\u0650\u0628\u064E\u0670\u062F\u0650\u064A" }, { id: 30, text: "\u0648\u064E\u0671\u062F\u06E1\u062E\u064F\u0644\u0650\u064A \u062C\u064E\u0646\u0651\u064E\u062A\u0650\u064A" }] }, { id: 90, name: "\u0627\u0644\u0628\u0644\u062F", transliteration: "Al-Balad", type: "meccan", total_verses: 20, verses: [{ id: 1, text: "\u0644\u064E\u0627\u0653 \u0623\u064F\u0642\u06E1\u0633\u0650\u0645\u064F \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u062F\u0650" }, { id: 2, text: "\u0648\u064E\u0623\u064E\u0646\u062A\u064E \u062D\u0650\u0644\u0651\u064F\u06E2 \u0628\u0650\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u062F\u0650" }, { id: 3, text: "\u0648\u064E\u0648\u064E\u0627\u0644\u0650\u062F\u0656 \u0648\u064E\u0645\u064E\u0627 \u0648\u064E\u0644\u064E\u062F\u064E" }, { id: 4, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0641\u0650\u064A \u0643\u064E\u0628\u064E\u062F\u064D" }, { id: 5, text: "\u0623\u064E\u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F \u0623\u064E\u0646 \u0644\u0651\u064E\u0646 \u064A\u064E\u0642\u06E1\u062F\u0650\u0631\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650 \u0623\u064E\u062D\u064E\u062F\u065E" }, { id: 6, text: "\u064A\u064E\u0642\u064F\u0648\u0644\u064F \u0623\u064E\u0647\u06E1\u0644\u064E\u0643\u06E1\u062A\u064F \u0645\u064E\u0627\u0644\u0657\u0627 \u0644\u0651\u064F\u0628\u064E\u062F\u064B\u0627" }, { id: 7, text: "\u0623\u064E\u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F \u0623\u064E\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0631\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062D\u064E\u062F\u064C" }, { id: 8, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u062C\u06E1\u0639\u064E\u0644 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u064A\u06E1\u0646\u064E\u064A\u06E1\u0646\u0650" }, { id: 9, text: "\u0648\u064E\u0644\u0650\u0633\u064E\u0627\u0646\u0657\u0627 \u0648\u064E\u0634\u064E\u0641\u064E\u062A\u064E\u064A\u06E1\u0646\u0650" }, { id: 10, text: "\u0648\u064E\u0647\u064E\u062F\u064E\u064A\u06E1\u0646\u064E\u0670\u0647\u064F \u0671\u0644\u0646\u0651\u064E\u062C\u06E1\u062F\u064E\u064A\u06E1\u0646\u0650" }, { id: 11, text: "\u0641\u064E\u0644\u064E\u0627 \u0671\u0642\u06E1\u062A\u064E\u062D\u064E\u0645\u064E \u0671\u0644\u06E1\u0639\u064E\u0642\u064E\u0628\u064E\u0629\u064E" }, { id: 12, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u0671\u0644\u06E1\u0639\u064E\u0642\u064E\u0628\u064E\u0629\u064F" }, { id: 13, text: "\u0641\u064E\u0643\u0651\u064F \u0631\u064E\u0642\u064E\u0628\u064E\u0629\u064D" }, { id: 14, text: "\u0623\u064E\u0648\u06E1 \u0625\u0650\u0637\u06E1\u0639\u064E\u0670\u0645\u065E \u0641\u0650\u064A \u064A\u064E\u0648\u06E1\u0645\u0656 \u0630\u0650\u064A \u0645\u064E\u0633\u06E1\u063A\u064E\u0628\u064E\u0629\u0656" }, { id: 15, text: "\u064A\u064E\u062A\u0650\u064A\u0645\u0657\u0627 \u0630\u064E\u0627 \u0645\u064E\u0642\u06E1\u0631\u064E\u0628\u064E\u0629\u064D" }, { id: 16, text: "\u0623\u064E\u0648\u06E1 \u0645\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u0657\u0627 \u0630\u064E\u0627 \u0645\u064E\u062A\u06E1\u0631\u064E\u0628\u064E\u0629\u0656" }, { id: 17, text: "\u062B\u064F\u0645\u0651\u064E \u0643\u064E\u0627\u0646\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u062A\u064E\u0648\u064E\u0627\u0635\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0671\u0644\u0635\u0651\u064E\u0628\u06E1\u0631\u0650 \u0648\u064E\u062A\u064E\u0648\u064E\u0627\u0635\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u0645\u064E\u0631\u06E1\u062D\u064E\u0645\u064E\u0629\u0650" }, { id: 18, text: "\u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u0645\u064E\u064A\u06E1\u0645\u064E\u0646\u064E\u0629\u0650" }, { id: 19, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0628\u0650\u0640\u0654\u064E\u0627\u064A\u064E\u0670\u062A\u0650\u0646\u064E\u0627 \u0647\u064F\u0645\u06E1 \u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u064F \u0671\u0644\u06E1\u0645\u064E\u0634\u06E1\u0640\u0654\u064E\u0645\u064E\u0629\u0650" }, { id: 20, text: "\u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0646\u064E\u0627\u0631\u065E \u0645\u0651\u064F\u0624\u06E1\u0635\u064E\u062F\u064E\u0629\u064F\u06E2" }] }, { id: 91, name: "\u0627\u0644\u0634\u0645\u0633", transliteration: "Ash-Shams", type: "meccan", total_verses: 15, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u0634\u0651\u064E\u0645\u06E1\u0633\u0650 \u0648\u064E\u0636\u064F\u062D\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 2, text: "\u0648\u064E\u0671\u0644\u06E1\u0642\u064E\u0645\u064E\u0631\u0650 \u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u0644\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 3, text: "\u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0644\u0651\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 4, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0625\u0650\u0630\u064E\u0627 \u064A\u064E\u063A\u06E1\u0634\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 5, text: "\u0648\u064E\u0671\u0644\u0633\u0651\u064E\u0645\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0645\u064E\u0627 \u0628\u064E\u0646\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 6, text: "\u0648\u064E\u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u0650 \u0648\u064E\u0645\u064E\u0627 \u0637\u064E\u062D\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 7, text: "\u0648\u064E\u0646\u064E\u0641\u06E1\u0633\u0656 \u0648\u064E\u0645\u064E\u0627 \u0633\u064E\u0648\u0651\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 8, text: "\u0641\u064E\u0623\u064E\u0644\u06E1\u0647\u064E\u0645\u064E\u0647\u064E\u0627 \u0641\u064F\u062C\u064F\u0648\u0631\u064E\u0647\u064E\u0627 \u0648\u064E\u062A\u064E\u0642\u06E1\u0648\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 9, text: "\u0642\u064E\u062F\u06E1 \u0623\u064E\u0641\u06E1\u0644\u064E\u062D\u064E \u0645\u064E\u0646 \u0632\u064E\u0643\u0651\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 10, text: "\u0648\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0627\u0628\u064E \u0645\u064E\u0646 \u062F\u064E\u0633\u0651\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 11, text: "\u0643\u064E\u0630\u0651\u064E\u0628\u064E\u062A\u06E1 \u062B\u064E\u0645\u064F\u0648\u062F\u064F \u0628\u0650\u0637\u064E\u063A\u06E1\u0648\u064E\u0649\u0670\u0647\u064E\u0627\u0653" }, { id: 12, text: "\u0625\u0650\u0630\u0650 \u0671\u0646\u06E2\u0628\u064E\u0639\u064E\u062B\u064E \u0623\u064E\u0634\u06E1\u0642\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 13, text: "\u0641\u064E\u0642\u064E\u0627\u0644\u064E \u0644\u064E\u0647\u064F\u0645\u06E1 \u0631\u064E\u0633\u064F\u0648\u0644\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0646\u064E\u0627\u0642\u064E\u0629\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0633\u064F\u0642\u06E1\u064A\u064E\u0670\u0647\u064E\u0627" }, { id: 14, text: "\u0641\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064F\u0648\u0647\u064F \u0641\u064E\u0639\u064E\u0642\u064E\u0631\u064F\u0648\u0647\u064E\u0627 \u0641\u064E\u062F\u064E\u0645\u06E1\u062F\u064E\u0645\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0631\u064E\u0628\u0651\u064F\u0647\u064F\u0645 \u0628\u0650\u0630\u064E\u0646\u06E2\u0628\u0650\u0647\u0650\u0645\u06E1 \u0641\u064E\u0633\u064E\u0648\u0651\u064E\u0649\u0670\u0647\u064E\u0627" }, { id: 15, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062E\u064E\u0627\u0641\u064F \u0639\u064F\u0642\u06E1\u0628\u064E\u0670\u0647\u064E\u0627" }] }, { id: 92, name: "\u0627\u0644\u0644\u064A\u0644", transliteration: "Al-Layl", type: "meccan", total_verses: 21, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0625\u0650\u0630\u064E\u0627 \u064A\u064E\u063A\u06E1\u0634\u064E\u0649\u0670" }, { id: 2, text: "\u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0647\u064E\u0627\u0631\u0650 \u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u062C\u064E\u0644\u0651\u064E\u0649\u0670" }, { id: 3, text: "\u0648\u064E\u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u0630\u0651\u064E\u0643\u064E\u0631\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064F\u0646\u062B\u064E\u0649\u0670\u0653" }, { id: 4, text: "\u0625\u0650\u0646\u0651\u064E \u0633\u064E\u0639\u06E1\u064A\u064E\u0643\u064F\u0645\u06E1 \u0644\u064E\u0634\u064E\u062A\u0651\u064E\u0649\u0670" }, { id: 5, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u0623\u064E\u0639\u06E1\u0637\u064E\u0649\u0670 \u0648\u064E\u0671\u062A\u0651\u064E\u0642\u064E\u0649\u0670" }, { id: 6, text: "\u0648\u064E\u0635\u064E\u062F\u0651\u064E\u0642\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670" }, { id: 7, text: "\u0641\u064E\u0633\u064E\u0646\u064F\u064A\u064E\u0633\u0651\u0650\u0631\u064F\u0647\u064F\u06E5 \u0644\u0650\u0644\u06E1\u064A\u064F\u0633\u06E1\u0631\u064E\u0649\u0670" }, { id: 8, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u06E2 \u0628\u064E\u062E\u0650\u0644\u064E \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0646\u064E\u0649\u0670" }, { id: 9, text: "\u0648\u064E\u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0628\u0650\u0671\u0644\u06E1\u062D\u064F\u0633\u06E1\u0646\u064E\u0649\u0670" }, { id: 10, text: "\u0641\u064E\u0633\u064E\u0646\u064F\u064A\u064E\u0633\u0651\u0650\u0631\u064F\u0647\u064F\u06E5 \u0644\u0650\u0644\u06E1\u0639\u064F\u0633\u06E1\u0631\u064E\u0649\u0670" }, { id: 11, text: "\u0648\u064E\u0645\u064E\u0627 \u064A\u064F\u063A\u06E1\u0646\u0650\u064A \u0639\u064E\u0646\u06E1\u0647\u064F \u0645\u064E\u0627\u0644\u064F\u0647\u064F\u06E5\u0653 \u0625\u0650\u0630\u064E\u0627 \u062A\u064E\u0631\u064E\u062F\u0651\u064E\u0649\u0670\u0653" }, { id: 12, text: "\u0625\u0650\u0646\u0651\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0646\u064E\u0627 \u0644\u064E\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670" }, { id: 13, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E \u0644\u064E\u0646\u064E\u0627 \u0644\u064E\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064E \u0648\u064E\u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670" }, { id: 14, text: "\u0641\u064E\u0623\u064E\u0646\u0630\u064E\u0631\u06E1\u062A\u064F\u0643\u064F\u0645\u06E1 \u0646\u064E\u0627\u0631\u0657\u0627 \u062A\u064E\u0644\u064E\u0638\u0651\u064E\u0649\u0670" }, { id: 15, text: "\u0644\u064E\u0627 \u064A\u064E\u0635\u06E1\u0644\u064E\u0649\u0670\u0647\u064E\u0627\u0653 \u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0634\u06E1\u0642\u064E\u0649" }, { id: 16, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0648\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670" }, { id: 17, text: "\u0648\u064E\u0633\u064E\u064A\u064F\u062C\u064E\u0646\u0651\u064E\u0628\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u062A\u06E1\u0642\u064E\u0649" }, { id: 18, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0624\u06E1\u062A\u0650\u064A \u0645\u064E\u0627\u0644\u064E\u0647\u064F\u06E5 \u064A\u064E\u062A\u064E\u0632\u064E\u0643\u0651\u064E\u0649\u0670" }, { id: 19, text: "\u0648\u064E\u0645\u064E\u0627 \u0644\u0650\u0623\u064E\u062D\u064E\u062F\u064D \u0639\u0650\u0646\u062F\u064E\u0647\u064F\u06E5 \u0645\u0650\u0646 \u0646\u0651\u0650\u0639\u06E1\u0645\u064E\u0629\u0656 \u062A\u064F\u062C\u06E1\u0632\u064E\u0649\u0670\u0653" }, { id: 20, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0628\u06E1\u062A\u0650\u063A\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u062C\u06E1\u0647\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650 \u0671\u0644\u06E1\u0623\u064E\u0639\u06E1\u0644\u064E\u0649\u0670" }, { id: 21, text: "\u0648\u064E\u0644\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670" }] }, { id: 93, name: "\u0627\u0644\u0636\u062D\u0649", transliteration: "Ad-Duhaa", type: "meccan", total_verses: 11, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u0636\u0651\u064F\u062D\u064E\u0649\u0670" }, { id: 2, text: "\u0648\u064E\u0671\u0644\u0651\u064E\u064A\u06E1\u0644\u0650 \u0625\u0650\u0630\u064E\u0627 \u0633\u064E\u062C\u064E\u0649\u0670" }, { id: 3, text: "\u0645\u064E\u0627 \u0648\u064E\u062F\u0651\u064E\u0639\u064E\u0643\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0648\u064E\u0645\u064E\u0627 \u0642\u064E\u0644\u064E\u0649\u0670" }, { id: 4, text: "\u0648\u064E\u0644\u064E\u0644\u06E1\u0623\u0653\u062E\u0650\u0631\u064E\u0629\u064F \u062E\u064E\u064A\u06E1\u0631\u065E \u0644\u0651\u064E\u0643\u064E \u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u0623\u064F\u0648\u0644\u064E\u0649\u0670" }, { id: 5, text: "\u0648\u064E\u0644\u064E\u0633\u064E\u0648\u06E1\u0641\u064E \u064A\u064F\u0639\u06E1\u0637\u0650\u064A\u0643\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0641\u064E\u062A\u064E\u0631\u06E1\u0636\u064E\u0649\u0670\u0653" }, { id: 6, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062C\u0650\u062F\u06E1\u0643\u064E \u064A\u064E\u062A\u0650\u064A\u0645\u0657\u0627 \u0641\u064E\u0640\u0654\u064E\u0627\u0648\u064E\u0649\u0670" }, { id: 7, text: "\u0648\u064E\u0648\u064E\u062C\u064E\u062F\u064E\u0643\u064E \u0636\u064E\u0627\u0653\u0644\u0651\u0657\u0627 \u0641\u064E\u0647\u064E\u062F\u064E\u0649\u0670" }, { id: 8, text: "\u0648\u064E\u0648\u064E\u062C\u064E\u062F\u064E\u0643\u064E \u0639\u064E\u0627\u0653\u0626\u0650\u0644\u0657\u0627 \u0641\u064E\u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670" }, { id: 9, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u06E1\u064A\u064E\u062A\u0650\u064A\u0645\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0642\u06E1\u0647\u064E\u0631\u06E1" }, { id: 10, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0671\u0644\u0633\u0651\u064E\u0627\u0653\u0626\u0650\u0644\u064E \u0641\u064E\u0644\u064E\u0627 \u062A\u064E\u0646\u06E1\u0647\u064E\u0631\u06E1" }, { id: 11, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0628\u0650\u0646\u0650\u0639\u06E1\u0645\u064E\u0629\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u062D\u064E\u062F\u0651\u0650\u062B\u06E1" }] }, { id: 94, name: "\u0627\u0644\u0634\u0631\u062D", transliteration: "Ash-Sharh", type: "meccan", total_verses: 8, verses: [{ id: 1, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u0646\u064E\u0634\u06E1\u0631\u064E\u062D\u06E1 \u0644\u064E\u0643\u064E \u0635\u064E\u062F\u06E1\u0631\u064E\u0643\u064E" }, { id: 2, text: "\u0648\u064E\u0648\u064E\u0636\u064E\u0639\u06E1\u0646\u064E\u0627 \u0639\u064E\u0646\u0643\u064E \u0648\u0650\u0632\u06E1\u0631\u064E\u0643\u064E" }, { id: 3, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0646\u0642\u064E\u0636\u064E \u0638\u064E\u0647\u06E1\u0631\u064E\u0643\u064E" }, { id: 4, text: "\u0648\u064E\u0631\u064E\u0641\u064E\u0639\u06E1\u0646\u064E\u0627 \u0644\u064E\u0643\u064E \u0630\u0650\u0643\u06E1\u0631\u064E\u0643\u064E" }, { id: 5, text: "\u0641\u064E\u0625\u0650\u0646\u0651\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0639\u064F\u0633\u06E1\u0631\u0650 \u064A\u064F\u0633\u06E1\u0631\u064B\u0627" }, { id: 6, text: "\u0625\u0650\u0646\u0651\u064E \u0645\u064E\u0639\u064E \u0671\u0644\u06E1\u0639\u064F\u0633\u06E1\u0631\u0650 \u064A\u064F\u0633\u06E1\u0631\u0657\u0627" }, { id: 7, text: "\u0641\u064E\u0625\u0650\u0630\u064E\u0627 \u0641\u064E\u0631\u064E\u063A\u06E1\u062A\u064E \u0641\u064E\u0671\u0646\u0635\u064E\u0628\u06E1" }, { id: 8, text: "\u0648\u064E\u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0641\u064E\u0671\u0631\u06E1\u063A\u064E\u0628" }] }, { id: 95, name: "\u0627\u0644\u062A\u064A\u0646", transliteration: "At-Tin", type: "meccan", total_verses: 8, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u062A\u0651\u0650\u064A\u0646\u0650 \u0648\u064E\u0671\u0644\u0632\u0651\u064E\u064A\u06E1\u062A\u064F\u0648\u0646\u0650" }, { id: 2, text: "\u0648\u064E\u0637\u064F\u0648\u0631\u0650 \u0633\u0650\u064A\u0646\u0650\u064A\u0646\u064E" }, { id: 3, text: "\u0648\u064E\u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u0644\u064E\u062F\u0650 \u0671\u0644\u06E1\u0623\u064E\u0645\u0650\u064A\u0646\u0650" }, { id: 4, text: "\u0644\u064E\u0642\u064E\u062F\u06E1 \u062E\u064E\u0644\u064E\u0642\u06E1\u0646\u064E\u0627 \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0641\u0650\u064A\u0653 \u0623\u064E\u062D\u06E1\u0633\u064E\u0646\u0650 \u062A\u064E\u0642\u06E1\u0648\u0650\u064A\u0645\u0656" }, { id: 5, text: "\u062B\u064F\u0645\u0651\u064E \u0631\u064E\u062F\u064E\u062F\u06E1\u0646\u064E\u0670\u0647\u064F \u0623\u064E\u0633\u06E1\u0641\u064E\u0644\u064E \u0633\u064E\u0670\u0641\u0650\u0644\u0650\u064A\u0646\u064E" }, { id: 6, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0641\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0623\u064E\u062C\u06E1\u0631\u064C \u063A\u064E\u064A\u06E1\u0631\u064F \u0645\u064E\u0645\u06E1\u0646\u064F\u0648\u0646\u0656" }, { id: 7, text: "\u0641\u064E\u0645\u064E\u0627 \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F\u0643\u064E \u0628\u064E\u0639\u06E1\u062F\u064F \u0628\u0650\u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 8, text: "\u0623\u064E\u0644\u064E\u064A\u06E1\u0633\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0628\u0650\u0623\u064E\u062D\u06E1\u0643\u064E\u0645\u0650 \u0671\u0644\u06E1\u062D\u064E\u0670\u0643\u0650\u0645\u0650\u064A\u0646\u064E" }] }, { id: 96, name: "\u0627\u0644\u0639\u0644\u0642", transliteration: "Al-'Alaq", type: "meccan", total_verses: 19, verses: [{ id: 1, text: "\u0671\u0642\u06E1\u0631\u064E\u0623\u06E1 \u0628\u0650\u0671\u0633\u06E1\u0645\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062E\u064E\u0644\u064E\u0642\u064E" }, { id: 2, text: "\u062E\u064E\u0644\u064E\u0642\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0645\u0650\u0646\u06E1 \u0639\u064E\u0644\u064E\u0642\u064D" }, { id: 3, text: "\u0671\u0642\u06E1\u0631\u064E\u0623\u06E1 \u0648\u064E\u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0671\u0644\u06E1\u0623\u064E\u0643\u06E1\u0631\u064E\u0645\u064F" }, { id: 4, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u0639\u064E\u0644\u0651\u064E\u0645\u064E \u0628\u0650\u0671\u0644\u06E1\u0642\u064E\u0644\u064E\u0645\u0650" }, { id: 5, text: "\u0639\u064E\u0644\u0651\u064E\u0645\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0645\u064E\u0627 \u0644\u064E\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u06E1" }, { id: 6, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u0653 \u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0644\u064E\u064A\u064E\u0637\u06E1\u063A\u064E\u0649\u0670\u0653" }, { id: 7, text: "\u0623\u064E\u0646 \u0631\u0651\u064E\u0621\u064E\u0627\u0647\u064F \u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0646\u064E\u0649\u0670\u0653" }, { id: 8, text: "\u0625\u0650\u0646\u0651\u064E \u0625\u0650\u0644\u064E\u0649\u0670 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0671\u0644\u0631\u0651\u064F\u062C\u06E1\u0639\u064E\u0649\u0670\u0653" }, { id: 9, text: "\u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u0646\u06E1\u0647\u064E\u0649\u0670" }, { id: 10, text: "\u0639\u064E\u0628\u06E1\u062F\u064B\u0627 \u0625\u0650\u0630\u064E\u0627 \u0635\u064E\u0644\u0651\u064E\u0649\u0670\u0653" }, { id: 11, text: "\u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E \u0625\u0650\u0646 \u0643\u064E\u0627\u0646\u064E \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0647\u064F\u062F\u064E\u0649\u0670\u0653" }, { id: 12, text: "\u0623\u064E\u0648\u06E1 \u0623\u064E\u0645\u064E\u0631\u064E \u0628\u0650\u0671\u0644\u062A\u0651\u064E\u0642\u06E1\u0648\u064E\u0649\u0670\u0653" }, { id: 13, text: "\u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E \u0625\u0650\u0646 \u0643\u064E\u0630\u0651\u064E\u0628\u064E \u0648\u064E\u062A\u064E\u0648\u064E\u0644\u0651\u064E\u0649\u0670\u0653" }, { id: 14, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645 \u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u064A\u064E\u0631\u064E\u0649\u0670" }, { id: 15, text: "\u0643\u064E\u0644\u0651\u064E\u0627 \u0644\u064E\u0626\u0650\u0646 \u0644\u0651\u064E\u0645\u06E1 \u064A\u064E\u0646\u062A\u064E\u0647\u0650 \u0644\u064E\u0646\u064E\u0633\u06E1\u0641\u064E\u0639\u064E\u06E2\u0627 \u0628\u0650\u0671\u0644\u0646\u0651\u064E\u0627\u0635\u0650\u064A\u064E\u0629\u0650" }, { id: 16, text: "\u0646\u064E\u0627\u0635\u0650\u064A\u064E\u0629\u0656 \u0643\u064E\u0670\u0630\u0650\u0628\u064E\u0629\u064D \u062E\u064E\u0627\u0637\u0650\u0626\u064E\u0629\u0656" }, { id: 17, text: "\u0641\u064E\u0644\u06E1\u064A\u064E\u062F\u06E1\u0639\u064F \u0646\u064E\u0627\u062F\u0650\u064A\u064E\u0647\u064F\u06E5" }, { id: 18, text: "\u0633\u064E\u0646\u064E\u062F\u06E1\u0639\u064F \u0671\u0644\u0632\u0651\u064E\u0628\u064E\u0627\u0646\u0650\u064A\u064E\u0629\u064E" }, { id: 19, text: "\u0643\u064E\u0644\u0651\u064E\u0627 \u0644\u064E\u0627 \u062A\u064F\u0637\u0650\u0639\u06E1\u0647\u064F \u0648\u064E\u0671\u0633\u06E1\u062C\u064F\u062F\u06E1\u06E4 \u0648\u064E\u0671\u0642\u06E1\u062A\u064E\u0631\u0650\u0628\u06E9" }] }, { id: 97, name: "\u0627\u0644\u0642\u062F\u0631", transliteration: "Al-Qadr", type: "meccan", total_verses: 5, verses: [{ id: 1, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0646\u0632\u064E\u0644\u06E1\u0646\u064E\u0670\u0647\u064F \u0641\u0650\u064A \u0644\u064E\u064A\u06E1\u0644\u064E\u0629\u0650 \u0671\u0644\u06E1\u0642\u064E\u062F\u06E1\u0631\u0650" }, { id: 2, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u0644\u064E\u064A\u06E1\u0644\u064E\u0629\u064F \u0671\u0644\u06E1\u0642\u064E\u062F\u06E1\u0631\u0650" }, { id: 3, text: "\u0644\u064E\u064A\u06E1\u0644\u064E\u0629\u064F \u0671\u0644\u06E1\u0642\u064E\u062F\u06E1\u0631\u0650 \u062E\u064E\u064A\u06E1\u0631\u065E \u0645\u0651\u0650\u0646\u06E1 \u0623\u064E\u0644\u06E1\u0641\u0650 \u0634\u064E\u0647\u06E1\u0631\u0656" }, { id: 4, text: "\u062A\u064E\u0646\u064E\u0632\u0651\u064E\u0644\u064F \u0671\u0644\u06E1\u0645\u064E\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E\u0629\u064F \u0648\u064E\u0671\u0644\u0631\u0651\u064F\u0648\u062D\u064F \u0641\u0650\u064A\u0647\u064E\u0627 \u0628\u0650\u0625\u0650\u0630\u06E1\u0646\u0650 \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646 \u0643\u064F\u0644\u0651\u0650 \u0623\u064E\u0645\u06E1\u0631\u0656" }, { id: 5, text: "\u0633\u064E\u0644\u064E\u0670\u0645\u064C \u0647\u0650\u064A\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0645\u064E\u0637\u06E1\u0644\u064E\u0639\u0650 \u0671\u0644\u06E1\u0641\u064E\u062C\u06E1\u0631\u0650" }] }, { id: 98, name: "\u0627\u0644\u0628\u064A\u0646\u0629", transliteration: "Al-Bayyinah", type: "medinan", total_verses: 8, verses: [{ id: 1, text: "\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646\u0650 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0645\u064F\u0646\u0641\u064E\u0643\u0651\u0650\u064A\u0646\u064E \u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u062A\u064E\u0623\u06E1\u062A\u0650\u064A\u064E\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u064F" }, { id: 2, text: "\u0631\u064E\u0633\u064F\u0648\u0644\u065E \u0645\u0651\u0650\u0646\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u064A\u064E\u062A\u06E1\u0644\u064F\u0648\u0627\u0652 \u0635\u064F\u062D\u064F\u0641\u0657\u0627 \u0645\u0651\u064F\u0637\u064E\u0647\u0651\u064E\u0631\u064E\u0629\u0657" }, { id: 3, text: "\u0641\u0650\u064A\u0647\u064E\u0627 \u0643\u064F\u062A\u064F\u0628\u065E \u0642\u064E\u064A\u0651\u0650\u0645\u064E\u0629\u065E" }, { id: 4, text: "\u0648\u064E\u0645\u064E\u0627 \u062A\u064E\u0641\u064E\u0631\u0651\u064E\u0642\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0623\u064F\u0648\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u064E \u0625\u0650\u0644\u0651\u064E\u0627 \u0645\u0650\u0646\u06E2 \u0628\u064E\u0639\u06E1\u062F\u0650 \u0645\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E\u062A\u06E1\u0647\u064F\u0645\u064F \u0671\u0644\u06E1\u0628\u064E\u064A\u0651\u0650\u0646\u064E\u0629\u064F" }, { id: 5, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064F\u0645\u0650\u0631\u064F\u0648\u0653\u0627\u0652 \u0625\u0650\u0644\u0651\u064E\u0627 \u0644\u0650\u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0671\u0644\u0644\u0651\u064E\u0647\u064E \u0645\u064F\u062E\u06E1\u0644\u0650\u0635\u0650\u064A\u0646\u064E \u0644\u064E\u0647\u064F \u0671\u0644\u062F\u0651\u0650\u064A\u0646\u064E \u062D\u064F\u0646\u064E\u0641\u064E\u0627\u0653\u0621\u064E \u0648\u064E\u064A\u064F\u0642\u0650\u064A\u0645\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0644\u064E\u0648\u0670\u0629\u064E \u0648\u064E\u064A\u064F\u0624\u06E1\u062A\u064F\u0648\u0627\u0652 \u0671\u0644\u0632\u0651\u064E\u0643\u064E\u0648\u0670\u0629\u064E\u06DA \u0648\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u062F\u0650\u064A\u0646\u064F \u0671\u0644\u06E1\u0642\u064E\u064A\u0651\u0650\u0645\u064E\u0629\u0650" }, { id: 6, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0643\u064E\u0641\u064E\u0631\u064F\u0648\u0627\u0652 \u0645\u0650\u0646\u06E1 \u0623\u064E\u0647\u06E1\u0644\u0650 \u0671\u0644\u06E1\u0643\u0650\u062A\u064E\u0670\u0628\u0650 \u0648\u064E\u0671\u0644\u06E1\u0645\u064F\u0634\u06E1\u0631\u0650\u0643\u0650\u064A\u0646\u064E \u0641\u0650\u064A \u0646\u064E\u0627\u0631\u0650 \u062C\u064E\u0647\u064E\u0646\u0651\u064E\u0645\u064E \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653\u06DA \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u06E1 \u0634\u064E\u0631\u0651\u064F \u0671\u0644\u06E1\u0628\u064E\u0631\u0650\u064A\u0651\u064E\u0629\u0650" }, { id: 7, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0623\u064F\u0648\u0652\u0644\u064E\u0640\u0670\u0653\u0626\u0650\u0643\u064E \u0647\u064F\u0645\u06E1 \u062E\u064E\u064A\u06E1\u0631\u064F \u0671\u0644\u06E1\u0628\u064E\u0631\u0650\u064A\u0651\u064E\u0629\u0650" }, { id: 8, text: "\u062C\u064E\u0632\u064E\u0627\u0653\u0624\u064F\u0647\u064F\u0645\u06E1 \u0639\u0650\u0646\u062F\u064E \u0631\u064E\u0628\u0651\u0650\u0647\u0650\u0645\u06E1 \u062C\u064E\u0646\u0651\u064E\u0640\u0670\u062A\u064F \u0639\u064E\u062F\u06E1\u0646\u0656 \u062A\u064E\u062C\u06E1\u0631\u0650\u064A \u0645\u0650\u0646 \u062A\u064E\u062D\u06E1\u062A\u0650\u0647\u064E\u0627 \u0671\u0644\u06E1\u0623\u064E\u0646\u06E1\u0647\u064E\u0670\u0631\u064F \u062E\u064E\u0670\u0644\u0650\u062F\u0650\u064A\u0646\u064E \u0641\u0650\u064A\u0647\u064E\u0627\u0653 \u0623\u064E\u0628\u064E\u062F\u0657\u0627\u06D6 \u0631\u0651\u064E\u0636\u0650\u064A\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0639\u064E\u0646\u06E1\u0647\u064F\u0645\u06E1 \u0648\u064E\u0631\u064E\u0636\u064F\u0648\u0627\u0652 \u0639\u064E\u0646\u06E1\u0647\u064F\u06DA \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u0650\u0645\u064E\u0646\u06E1 \u062E\u064E\u0634\u0650\u064A\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u06E5" }] }, { id: 99, name: "\u0627\u0644\u0632\u0644\u0632\u0644\u0629", transliteration: "Az-Zalzalah", type: "medinan", total_verses: 8, verses: [{ id: 1, text: "\u0625\u0650\u0630\u064E\u0627 \u0632\u064F\u0644\u06E1\u0632\u0650\u0644\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0632\u0650\u0644\u06E1\u0632\u064E\u0627\u0644\u064E\u0647\u064E\u0627" }, { id: 2, text: "\u0648\u064E\u0623\u064E\u062E\u06E1\u0631\u064E\u062C\u064E\u062A\u0650 \u0671\u0644\u06E1\u0623\u064E\u0631\u06E1\u0636\u064F \u0623\u064E\u062B\u06E1\u0642\u064E\u0627\u0644\u064E\u0647\u064E\u0627" }, { id: 3, text: "\u0648\u064E\u0642\u064E\u0627\u0644\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064F \u0645\u064E\u0627 \u0644\u064E\u0647\u064E\u0627" }, { id: 4, text: "\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u062A\u064F\u062D\u064E\u062F\u0651\u0650\u062B\u064F \u0623\u064E\u062E\u06E1\u0628\u064E\u0627\u0631\u064E\u0647\u064E\u0627" }, { id: 5, text: "\u0628\u0650\u0623\u064E\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0643\u064E \u0623\u064E\u0648\u06E1\u062D\u064E\u0649\u0670 \u0644\u064E\u0647\u064E\u0627" }, { id: 6, text: "\u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u064A\u064E\u0635\u06E1\u062F\u064F\u0631\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0623\u064E\u0634\u06E1\u062A\u064E\u0627\u062A\u0657\u0627 \u0644\u0651\u0650\u064A\u064F\u0631\u064E\u0648\u06E1\u0627\u0652 \u0623\u064E\u0639\u06E1\u0645\u064E\u0670\u0644\u064E\u0647\u064F\u0645\u06E1" }, { id: 7, text: "\u0641\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0645\u0650\u062B\u06E1\u0642\u064E\u0627\u0644\u064E \u0630\u064E\u0631\u0651\u064E\u0629\u064D \u062E\u064E\u064A\u06E1\u0631\u0657\u0627 \u064A\u064E\u0631\u064E\u0647\u064F\u06E5" }, { id: 8, text: "\u0648\u064E\u0645\u064E\u0646 \u064A\u064E\u0639\u06E1\u0645\u064E\u0644\u06E1 \u0645\u0650\u062B\u06E1\u0642\u064E\u0627\u0644\u064E \u0630\u064E\u0631\u0651\u064E\u0629\u0656 \u0634\u064E\u0631\u0651\u0657\u0627 \u064A\u064E\u0631\u064E\u0647\u064F\u06E5" }] }, { id: 100, name: "\u0627\u0644\u0639\u0627\u062F\u064A\u0627\u062A", transliteration: "Al-'Adiyat", type: "meccan", total_verses: 11, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0670\u062F\u0650\u064A\u064E\u0670\u062A\u0650 \u0636\u064E\u0628\u06E1\u062D\u0657\u0627" }, { id: 2, text: "\u0641\u064E\u0671\u0644\u06E1\u0645\u064F\u0648\u0631\u0650\u064A\u064E\u0670\u062A\u0650 \u0642\u064E\u062F\u06E1\u062D\u0657\u0627" }, { id: 3, text: "\u0641\u064E\u0671\u0644\u06E1\u0645\u064F\u063A\u0650\u064A\u0631\u064E\u0670\u062A\u0650 \u0635\u064F\u0628\u06E1\u062D\u0657\u0627" }, { id: 4, text: "\u0641\u064E\u0623\u064E\u062B\u064E\u0631\u06E1\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u0646\u064E\u0642\u06E1\u0639\u0657\u0627" }, { id: 5, text: "\u0641\u064E\u0648\u064E\u0633\u064E\u0637\u06E1\u0646\u064E \u0628\u0650\u0647\u0650\u06E6 \u062C\u064E\u0645\u06E1\u0639\u064B\u0627" }, { id: 6, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0647\u0650\u06E6 \u0644\u064E\u0643\u064E\u0646\u064F\u0648\u062F\u065E" }, { id: 7, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0639\u064E\u0644\u064E\u0649\u0670 \u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0644\u064E\u0634\u064E\u0647\u0650\u064A\u062F\u065E" }, { id: 8, text: "\u0648\u064E\u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0644\u0650\u062D\u064F\u0628\u0651\u0650 \u0671\u0644\u06E1\u062E\u064E\u064A\u06E1\u0631\u0650 \u0644\u064E\u0634\u064E\u062F\u0650\u064A\u062F\u064C" }, { id: 9, text: "\u06DE\u0623\u064E\u0641\u064E\u0644\u064E\u0627 \u064A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F \u0625\u0650\u0630\u064E\u0627 \u0628\u064F\u0639\u06E1\u062B\u0650\u0631\u064E \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u06E1\u0642\u064F\u0628\u064F\u0648\u0631\u0650" }, { id: 10, text: "\u0648\u064E\u062D\u064F\u0635\u0651\u0650\u0644\u064E \u0645\u064E\u0627 \u0641\u0650\u064A \u0671\u0644\u0635\u0651\u064F\u062F\u064F\u0648\u0631\u0650" }, { id: 11, text: "\u0625\u0650\u0646\u0651\u064E \u0631\u064E\u0628\u0651\u064E\u0647\u064F\u0645 \u0628\u0650\u0647\u0650\u0645\u06E1 \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u0656 \u0644\u0651\u064E\u062E\u064E\u0628\u0650\u064A\u0631\u064F\u06E2" }] }, { id: 101, name: "\u0627\u0644\u0642\u0627\u0631\u0639\u0629", transliteration: "Al-Qari'ah", type: "meccan", total_verses: 11, verses: [{ id: 1, text: "\u0671\u0644\u06E1\u0642\u064E\u0627\u0631\u0650\u0639\u064E\u0629\u064F" }, { id: 2, text: "\u0645\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0627\u0631\u0650\u0639\u064E\u0629\u064F" }, { id: 3, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u0671\u0644\u06E1\u0642\u064E\u0627\u0631\u0650\u0639\u064E\u0629\u064F" }, { id: 4, text: "\u064A\u064E\u0648\u06E1\u0645\u064E \u064A\u064E\u0643\u064F\u0648\u0646\u064F \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064F \u0643\u064E\u0671\u0644\u06E1\u0641\u064E\u0631\u064E\u0627\u0634\u0650 \u0671\u0644\u06E1\u0645\u064E\u0628\u06E1\u062B\u064F\u0648\u062B\u0650" }, { id: 5, text: "\u0648\u064E\u062A\u064E\u0643\u064F\u0648\u0646\u064F \u0671\u0644\u06E1\u062C\u0650\u0628\u064E\u0627\u0644\u064F \u0643\u064E\u0671\u0644\u06E1\u0639\u0650\u0647\u06E1\u0646\u0650 \u0671\u0644\u06E1\u0645\u064E\u0646\u0641\u064F\u0648\u0634\u0650" }, { id: 6, text: "\u0641\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646 \u062B\u064E\u0642\u064F\u0644\u064E\u062A\u06E1 \u0645\u064E\u0648\u064E\u0670\u0632\u0650\u064A\u0646\u064F\u0647\u064F\u06E5" }, { id: 7, text: "\u0641\u064E\u0647\u064F\u0648\u064E \u0641\u0650\u064A \u0639\u0650\u064A\u0634\u064E\u0629\u0656 \u0631\u0651\u064E\u0627\u0636\u0650\u064A\u064E\u0629\u0656" }, { id: 8, text: "\u0648\u064E\u0623\u064E\u0645\u0651\u064E\u0627 \u0645\u064E\u0646\u06E1 \u062E\u064E\u0641\u0651\u064E\u062A\u06E1 \u0645\u064E\u0648\u064E\u0670\u0632\u0650\u064A\u0646\u064F\u0647\u064F\u06E5" }, { id: 9, text: "\u0641\u064E\u0623\u064F\u0645\u0651\u064F\u0647\u064F\u06E5 \u0647\u064E\u0627\u0648\u0650\u064A\u064E\u0629\u065E" }, { id: 10, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u0647\u0650\u064A\u064E\u0647\u06E1" }, { id: 11, text: "\u0646\u064E\u0627\u0631\u064C \u062D\u064E\u0627\u0645\u0650\u064A\u064E\u0629\u064F\u06E2" }] }, { id: 102, name: "\u0627\u0644\u062A\u0643\u0627\u062B\u0631", transliteration: "At-Takathur", type: "meccan", total_verses: 8, verses: [{ id: 1, text: "\u0623\u064E\u0644\u06E1\u0647\u064E\u0649\u0670\u0643\u064F\u0645\u064F \u0671\u0644\u062A\u0651\u064E\u0643\u064E\u0627\u062B\u064F\u0631\u064F" }, { id: 2, text: "\u062D\u064E\u062A\u0651\u064E\u0649\u0670 \u0632\u064F\u0631\u06E1\u062A\u064F\u0645\u064F \u0671\u0644\u06E1\u0645\u064E\u0642\u064E\u0627\u0628\u0650\u0631\u064E" }, { id: 3, text: "\u0643\u064E\u0644\u0651\u064E\u0627 \u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 4, text: "\u062B\u064F\u0645\u0651\u064E \u0643\u064E\u0644\u0651\u064E\u0627 \u0633\u064E\u0648\u06E1\u0641\u064E \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E" }, { id: 5, text: "\u0643\u064E\u0644\u0651\u064E\u0627 \u0644\u064E\u0648\u06E1 \u062A\u064E\u0639\u06E1\u0644\u064E\u0645\u064F\u0648\u0646\u064E \u0639\u0650\u0644\u06E1\u0645\u064E \u0671\u0644\u06E1\u064A\u064E\u0642\u0650\u064A\u0646\u0650" }, { id: 6, text: "\u0644\u064E\u062A\u064E\u0631\u064E\u0648\u064F\u0646\u0651\u064E \u0671\u0644\u06E1\u062C\u064E\u062D\u0650\u064A\u0645\u064E" }, { id: 7, text: "\u062B\u064F\u0645\u0651\u064E \u0644\u064E\u062A\u064E\u0631\u064E\u0648\u064F\u0646\u0651\u064E\u0647\u064E\u0627 \u0639\u064E\u064A\u06E1\u0646\u064E \u0671\u0644\u06E1\u064A\u064E\u0642\u0650\u064A\u0646\u0650" }, { id: 8, text: "\u062B\u064F\u0645\u0651\u064E \u0644\u064E\u062A\u064F\u0633\u06E1\u0640\u0654\u064E\u0644\u064F\u0646\u0651\u064E \u064A\u064E\u0648\u06E1\u0645\u064E\u0626\u0650\u0630\u064D \u0639\u064E\u0646\u0650 \u0671\u0644\u0646\u0651\u064E\u0639\u0650\u064A\u0645\u0650" }] }, { id: 103, name: "\u0627\u0644\u0639\u0635\u0631", transliteration: "Al-'Asr", type: "meccan", total_verses: 3, verses: [{ id: 1, text: "\u0648\u064E\u0671\u0644\u06E1\u0639\u064E\u0635\u06E1\u0631\u0650" }, { id: 2, text: "\u0625\u0650\u0646\u0651\u064E \u0671\u0644\u06E1\u0625\u0650\u0646\u0633\u064E\u0670\u0646\u064E \u0644\u064E\u0641\u0650\u064A \u062E\u064F\u0633\u06E1\u0631\u064D" }, { id: 3, text: "\u0625\u0650\u0644\u0651\u064E\u0627 \u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0621\u064E\u0627\u0645\u064E\u0646\u064F\u0648\u0627\u0652 \u0648\u064E\u0639\u064E\u0645\u0650\u0644\u064F\u0648\u0627\u0652 \u0671\u0644\u0635\u0651\u064E\u0640\u0670\u0644\u0650\u062D\u064E\u0670\u062A\u0650 \u0648\u064E\u062A\u064E\u0648\u064E\u0627\u0635\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0671\u0644\u06E1\u062D\u064E\u0642\u0651\u0650 \u0648\u064E\u062A\u064E\u0648\u064E\u0627\u0635\u064E\u0648\u06E1\u0627\u0652 \u0628\u0650\u0671\u0644\u0635\u0651\u064E\u0628\u06E1\u0631\u0650" }] }, { id: 104, name: "\u0627\u0644\u0647\u0645\u0632\u0629", transliteration: "Al-Humazah", type: "meccan", total_verses: 9, verses: [{ id: 1, text: "\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0643\u064F\u0644\u0651\u0650 \u0647\u064F\u0645\u064E\u0632\u064E\u0629\u0656 \u0644\u0651\u064F\u0645\u064E\u0632\u064E\u0629\u064D" }, { id: 2, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u062C\u064E\u0645\u064E\u0639\u064E \u0645\u064E\u0627\u0644\u0657\u0627 \u0648\u064E\u0639\u064E\u062F\u0651\u064E\u062F\u064E\u0647\u064F\u06E5" }, { id: 3, text: "\u064A\u064E\u062D\u06E1\u0633\u064E\u0628\u064F \u0623\u064E\u0646\u0651\u064E \u0645\u064E\u0627\u0644\u064E\u0647\u064F\u06E5\u0653 \u0623\u064E\u062E\u06E1\u0644\u064E\u062F\u064E\u0647\u064F\u06E5" }, { id: 4, text: "\u0643\u064E\u0644\u0651\u064E\u0627\u06D6 \u0644\u064E\u064A\u064F\u0646\u06E2\u0628\u064E\u0630\u064E\u0646\u0651\u064E \u0641\u0650\u064A \u0671\u0644\u06E1\u062D\u064F\u0637\u064E\u0645\u064E\u0629\u0650" }, { id: 5, text: "\u0648\u064E\u0645\u064E\u0627\u0653 \u0623\u064E\u062F\u06E1\u0631\u064E\u0649\u0670\u0643\u064E \u0645\u064E\u0627 \u0671\u0644\u06E1\u062D\u064F\u0637\u064E\u0645\u064E\u0629\u064F" }, { id: 6, text: "\u0646\u064E\u0627\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0671\u0644\u06E1\u0645\u064F\u0648\u0642\u064E\u062F\u064E\u0629\u064F" }, { id: 7, text: "\u0671\u0644\u0651\u064E\u062A\u0650\u064A \u062A\u064E\u0637\u0651\u064E\u0644\u0650\u0639\u064F \u0639\u064E\u0644\u064E\u0649 \u0671\u0644\u06E1\u0623\u064E\u0641\u06E1\u0640\u0654\u0650\u062F\u064E\u0629\u0650" }, { id: 8, text: "\u0625\u0650\u0646\u0651\u064E\u0647\u064E\u0627 \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645 \u0645\u0651\u064F\u0624\u06E1\u0635\u064E\u062F\u064E\u0629\u065E" }, { id: 9, text: "\u0641\u0650\u064A \u0639\u064E\u0645\u064E\u062F\u0656 \u0645\u0651\u064F\u0645\u064E\u062F\u0651\u064E\u062F\u064E\u0629\u0650\u06ED" }] }, { id: 105, name: "\u0627\u0644\u0641\u064A\u0644", transliteration: "Al-Fil", type: "meccan", total_verses: 5, verses: [{ id: 1, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u062A\u064E\u0631\u064E \u0643\u064E\u064A\u06E1\u0641\u064E \u0641\u064E\u0639\u064E\u0644\u064E \u0631\u064E\u0628\u0651\u064F\u0643\u064E \u0628\u0650\u0623\u064E\u0635\u06E1\u062D\u064E\u0670\u0628\u0650 \u0671\u0644\u06E1\u0641\u0650\u064A\u0644\u0650" }, { id: 2, text: "\u0623\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u062C\u06E1\u0639\u064E\u0644\u06E1 \u0643\u064E\u064A\u06E1\u062F\u064E\u0647\u064F\u0645\u06E1 \u0641\u0650\u064A \u062A\u064E\u0636\u06E1\u0644\u0650\u064A\u0644\u0656" }, { id: 3, text: "\u0648\u064E\u0623\u064E\u0631\u06E1\u0633\u064E\u0644\u064E \u0639\u064E\u0644\u064E\u064A\u06E1\u0647\u0650\u0645\u06E1 \u0637\u064E\u064A\u06E1\u0631\u064B\u0627 \u0623\u064E\u0628\u064E\u0627\u0628\u0650\u064A\u0644\u064E" }, { id: 4, text: "\u062A\u064E\u0631\u06E1\u0645\u0650\u064A\u0647\u0650\u0645 \u0628\u0650\u062D\u0650\u062C\u064E\u0627\u0631\u064E\u0629\u0656 \u0645\u0651\u0650\u0646 \u0633\u0650\u062C\u0651\u0650\u064A\u0644\u0656" }, { id: 5, text: "\u0641\u064E\u062C\u064E\u0639\u064E\u0644\u064E\u0647\u064F\u0645\u06E1 \u0643\u064E\u0639\u064E\u0635\u06E1\u0641\u0656 \u0645\u0651\u064E\u0623\u06E1\u0643\u064F\u0648\u0644\u0650\u06ED" }] }, { id: 106, name: "\u0642\u0631\u064A\u0634", transliteration: "Quraysh", type: "meccan", total_verses: 4, verses: [{ id: 1, text: "\u0644\u0650\u0625\u0650\u064A\u0644\u064E\u0670\u0641\u0650 \u0642\u064F\u0631\u064E\u064A\u06E1\u0634\u064D" }, { id: 2, text: "\u0625\u0650\u06E6\u0644\u064E\u0670\u0641\u0650\u0647\u0650\u0645\u06E1 \u0631\u0650\u062D\u06E1\u0644\u064E\u0629\u064E \u0671\u0644\u0634\u0651\u0650\u062A\u064E\u0627\u0653\u0621\u0650 \u0648\u064E\u0671\u0644\u0635\u0651\u064E\u064A\u06E1\u0641\u0650" }, { id: 3, text: "\u0641\u064E\u0644\u06E1\u064A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0627\u0652 \u0631\u064E\u0628\u0651\u064E \u0647\u064E\u0670\u0630\u064E\u0627 \u0671\u0644\u06E1\u0628\u064E\u064A\u06E1\u062A\u0650" }, { id: 4, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0653 \u0623\u064E\u0637\u06E1\u0639\u064E\u0645\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646 \u062C\u064F\u0648\u0639\u0656 \u0648\u064E\u0621\u064E\u0627\u0645\u064E\u0646\u064E\u0647\u064F\u0645 \u0645\u0651\u0650\u0646\u06E1 \u062E\u064E\u0648\u06E1\u0641\u0650\u06ED" }] }, { id: 107, name: "\u0627\u0644\u0645\u0627\u0639\u0648\u0646", transliteration: "Al-Ma'un", type: "meccan", total_verses: 7, verses: [{ id: 1, text: "\u0623\u064E\u0631\u064E\u0621\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0643\u064E\u0630\u0651\u0650\u0628\u064F \u0628\u0650\u0671\u0644\u062F\u0651\u0650\u064A\u0646\u0650" }, { id: 2, text: "\u0641\u064E\u0630\u064E\u0670\u0644\u0650\u0643\u064E \u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064E\u062F\u064F\u0639\u0651\u064F \u0671\u0644\u06E1\u064A\u064E\u062A\u0650\u064A\u0645\u064E" }, { id: 3, text: "\u0648\u064E\u0644\u064E\u0627 \u064A\u064E\u062D\u064F\u0636\u0651\u064F \u0639\u064E\u0644\u064E\u0649\u0670 \u0637\u064E\u0639\u064E\u0627\u0645\u0650 \u0671\u0644\u06E1\u0645\u0650\u0633\u06E1\u0643\u0650\u064A\u0646\u0650" }, { id: 4, text: "\u0641\u064E\u0648\u064E\u064A\u06E1\u0644\u065E \u0644\u0651\u0650\u0644\u06E1\u0645\u064F\u0635\u064E\u0644\u0651\u0650\u064A\u0646\u064E" }, { id: 5, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u0639\u064E\u0646 \u0635\u064E\u0644\u064E\u0627\u062A\u0650\u0647\u0650\u0645\u06E1 \u0633\u064E\u0627\u0647\u064F\u0648\u0646\u064E" }, { id: 6, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A\u0646\u064E \u0647\u064F\u0645\u06E1 \u064A\u064F\u0631\u064E\u0627\u0653\u0621\u064F\u0648\u0646\u064E" }, { id: 7, text: "\u0648\u064E\u064A\u064E\u0645\u06E1\u0646\u064E\u0639\u064F\u0648\u0646\u064E \u0671\u0644\u06E1\u0645\u064E\u0627\u0639\u064F\u0648\u0646\u064E" }] }, { id: 108, name: "\u0627\u0644\u0643\u0648\u062B\u0631", transliteration: "Al-Kawthar", type: "meccan", total_verses: 3, verses: [{ id: 1, text: "\u0625\u0650\u0646\u0651\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0637\u064E\u064A\u06E1\u0646\u064E\u0670\u0643\u064E \u0671\u0644\u06E1\u0643\u064E\u0648\u06E1\u062B\u064E\u0631\u064E" }, { id: 2, text: "\u0641\u064E\u0635\u064E\u0644\u0651\u0650 \u0644\u0650\u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0648\u064E\u0671\u0646\u06E1\u062D\u064E\u0631\u06E1" }, { id: 3, text: "\u0625\u0650\u0646\u0651\u064E \u0634\u064E\u0627\u0646\u0650\u0626\u064E\u0643\u064E \u0647\u064F\u0648\u064E \u0671\u0644\u06E1\u0623\u064E\u0628\u06E1\u062A\u064E\u0631\u064F" }] }, { id: 109, name: "\u0627\u0644\u0643\u0627\u0641\u0631\u0648\u0646", transliteration: "Al-Kafirun", type: "meccan", total_verses: 6, verses: [{ id: 1, text: "\u0642\u064F\u0644\u06E1 \u064A\u064E\u0640\u0670\u0653\u0623\u064E\u064A\u0651\u064F\u0647\u064E\u0627 \u0671\u0644\u06E1\u0643\u064E\u0670\u0641\u0650\u0631\u064F\u0648\u0646\u064E" }, { id: 2, text: "\u0644\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064F \u0645\u064E\u0627 \u062A\u064E\u0639\u06E1\u0628\u064F\u062F\u064F\u0648\u0646\u064E" }, { id: 3, text: "\u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0670\u0628\u0650\u062F\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064F" }, { id: 4, text: "\u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u064E\u0627\u06E0 \u0639\u064E\u0627\u0628\u0650\u062F\u065E \u0645\u0651\u064E\u0627 \u0639\u064E\u0628\u064E\u062F\u062A\u0651\u064F\u0645\u06E1" }, { id: 5, text: "\u0648\u064E\u0644\u064E\u0627\u0653 \u0623\u064E\u0646\u062A\u064F\u0645\u06E1 \u0639\u064E\u0670\u0628\u0650\u062F\u064F\u0648\u0646\u064E \u0645\u064E\u0627\u0653 \u0623\u064E\u0639\u06E1\u0628\u064F\u062F\u064F" }, { id: 6, text: "\u0644\u064E\u0643\u064F\u0645\u06E1 \u062F\u0650\u064A\u0646\u064F\u0643\u064F\u0645\u06E1 \u0648\u064E\u0644\u0650\u064A\u064E \u062F\u0650\u064A\u0646\u0650" }] }, { id: 110, name: "\u0627\u0644\u0646\u0635\u0631", transliteration: "An-Nasr", type: "medinan", total_verses: 3, verses: [{ id: 1, text: "\u0625\u0650\u0630\u064E\u0627 \u062C\u064E\u0627\u0653\u0621\u064E \u0646\u064E\u0635\u06E1\u0631\u064F \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0648\u064E\u0671\u0644\u06E1\u0641\u064E\u062A\u06E1\u062D\u064F" }, { id: 2, text: "\u0648\u064E\u0631\u064E\u0623\u064E\u064A\u06E1\u062A\u064E \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u064E \u064A\u064E\u062F\u06E1\u062E\u064F\u0644\u064F\u0648\u0646\u064E \u0641\u0650\u064A \u062F\u0650\u064A\u0646\u0650 \u0671\u0644\u0644\u0651\u064E\u0647\u0650 \u0623\u064E\u0641\u06E1\u0648\u064E\u0627\u062C\u0657\u0627" }, { id: 3, text: "\u0641\u064E\u0633\u064E\u0628\u0651\u0650\u062D\u06E1 \u0628\u0650\u062D\u064E\u0645\u06E1\u062F\u0650 \u0631\u064E\u0628\u0651\u0650\u0643\u064E \u0648\u064E\u0671\u0633\u06E1\u062A\u064E\u063A\u06E1\u0641\u0650\u0631\u06E1\u0647\u064F\u06DA \u0625\u0650\u0646\u0651\u064E\u0647\u064F\u06E5 \u0643\u064E\u0627\u0646\u064E \u062A\u064E\u0648\u0651\u064E\u0627\u0628\u064E\u06E2\u0627" }] }, { id: 111, name: "\u0627\u0644\u0645\u0633\u062F", transliteration: "Al-Masad", type: "meccan", total_verses: 5, verses: [{ id: 1, text: "\u062A\u064E\u0628\u0651\u064E\u062A\u06E1 \u064A\u064E\u062F\u064E\u0627\u0653 \u0623\u064E\u0628\u0650\u064A \u0644\u064E\u0647\u064E\u0628\u0656 \u0648\u064E\u062A\u064E\u0628\u0651\u064E" }, { id: 2, text: "\u0645\u064E\u0627\u0653 \u0623\u064E\u063A\u06E1\u0646\u064E\u0649\u0670 \u0639\u064E\u0646\u06E1\u0647\u064F \u0645\u064E\u0627\u0644\u064F\u0647\u064F\u06E5 \u0648\u064E\u0645\u064E\u0627 \u0643\u064E\u0633\u064E\u0628\u064E" }, { id: 3, text: "\u0633\u064E\u064A\u064E\u0635\u06E1\u0644\u064E\u0649\u0670 \u0646\u064E\u0627\u0631\u0657\u0627 \u0630\u064E\u0627\u062A\u064E \u0644\u064E\u0647\u064E\u0628\u0656" }, { id: 4, text: "\u0648\u064E\u0671\u0645\u06E1\u0631\u064E\u0623\u064E\u062A\u064F\u0647\u064F\u06E5 \u062D\u064E\u0645\u0651\u064E\u0627\u0644\u064E\u0629\u064E \u0671\u0644\u06E1\u062D\u064E\u0637\u064E\u0628\u0650" }, { id: 5, text: "\u0641\u0650\u064A \u062C\u0650\u064A\u062F\u0650\u0647\u064E\u0627 \u062D\u064E\u0628\u06E1\u0644\u065E \u0645\u0651\u0650\u0646 \u0645\u0651\u064E\u0633\u064E\u062F\u0650\u06ED" }] }, { id: 112, name: "\u0627\u0644\u0625\u062E\u0644\u0627\u0635", transliteration: "Al-Ikhlas", type: "meccan", total_verses: 4, verses: [{ id: 1, text: "\u0642\u064F\u0644\u06E1 \u0647\u064F\u0648\u064E \u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0623\u064E\u062D\u064E\u062F\u064C" }, { id: 2, text: "\u0671\u0644\u0644\u0651\u064E\u0647\u064F \u0671\u0644\u0635\u0651\u064E\u0645\u064E\u062F\u064F" }, { id: 3, text: "\u0644\u064E\u0645\u06E1 \u064A\u064E\u0644\u0650\u062F\u06E1 \u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064F\u0648\u0644\u064E\u062F\u06E1" }, { id: 4, text: "\u0648\u064E\u0644\u064E\u0645\u06E1 \u064A\u064E\u0643\u064F\u0646 \u0644\u0651\u064E\u0647\u064F\u06E5 \u0643\u064F\u0641\u064F\u0648\u064B\u0627 \u0623\u064E\u062D\u064E\u062F\u064F\u06E2" }] }, { id: 113, name: "\u0627\u0644\u0641\u0644\u0642", transliteration: "Al-Falaq", type: "meccan", total_verses: 5, verses: [{ id: 1, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0639\u064F\u0648\u0630\u064F \u0628\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u06E1\u0641\u064E\u0644\u064E\u0642\u0650" }, { id: 2, text: "\u0645\u0650\u0646 \u0634\u064E\u0631\u0651\u0650 \u0645\u064E\u0627 \u062E\u064E\u0644\u064E\u0642\u064E" }, { id: 3, text: "\u0648\u064E\u0645\u0650\u0646 \u0634\u064E\u0631\u0651\u0650 \u063A\u064E\u0627\u0633\u0650\u0642\u064D \u0625\u0650\u0630\u064E\u0627 \u0648\u064E\u0642\u064E\u0628\u064E" }, { id: 4, text: "\u0648\u064E\u0645\u0650\u0646 \u0634\u064E\u0631\u0651\u0650 \u0671\u0644\u0646\u0651\u064E\u0641\u0651\u064E\u0640\u0670\u062B\u064E\u0670\u062A\u0650 \u0641\u0650\u064A \u0671\u0644\u06E1\u0639\u064F\u0642\u064E\u062F\u0650" }, { id: 5, text: "\u0648\u064E\u0645\u0650\u0646 \u0634\u064E\u0631\u0651\u0650 \u062D\u064E\u0627\u0633\u0650\u062F\u064D \u0625\u0650\u0630\u064E\u0627 \u062D\u064E\u0633\u064E\u062F\u064E" }] }, { id: 114, name: "\u0627\u0644\u0646\u0627\u0633", transliteration: "An-Nas", type: "meccan", total_verses: 6, verses: [{ id: 1, text: "\u0642\u064F\u0644\u06E1 \u0623\u064E\u0639\u064F\u0648\u0630\u064F \u0628\u0650\u0631\u064E\u0628\u0651\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650" }, { id: 2, text: "\u0645\u064E\u0644\u0650\u0643\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650" }, { id: 3, text: "\u0625\u0650\u0644\u064E\u0670\u0647\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650" }, { id: 4, text: "\u0645\u0650\u0646 \u0634\u064E\u0631\u0651\u0650 \u0671\u0644\u06E1\u0648\u064E\u0633\u06E1\u0648\u064E\u0627\u0633\u0650 \u0671\u0644\u06E1\u062E\u064E\u0646\u0651\u064E\u0627\u0633\u0650" }, { id: 5, text: "\u0671\u0644\u0651\u064E\u0630\u0650\u064A \u064A\u064F\u0648\u064E\u0633\u06E1\u0648\u0650\u0633\u064F \u0641\u0650\u064A \u0635\u064F\u062F\u064F\u0648\u0631\u0650 \u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650" }, { id: 6, text: "\u0645\u0650\u0646\u064E \u0671\u0644\u06E1\u062C\u0650\u0646\u0651\u064E\u0629\u0650 \u0648\u064E\u0671\u0644\u0646\u0651\u064E\u0627\u0633\u0650" }] }];

// src/SurahModal.ts
var Surah = class {
};
var Surahs = quran_default.map((surah) => Object.assign(new Surah(), surah));
var SurahModal = class extends import_obsidian2.SuggestModal {
  getSuggestions(query) {
    if (Number(query)) {
      return Surahs.filter(
        (surah) => surah.id.toString().includes(query)
      );
    } else {
      return Surahs.filter(
        (surah) => surah.name.toLowerCase().includes(query.toLowerCase())
      );
    }
  }
  // Renders each suggestion item.
  renderSuggestion(surah, el) {
    el.createEl("div", { text: surah.name });
    el.createEl("small", {
      text: "\u062A\u0631\u062A\u064A\u0628\u0647\u0627: " + surah.id + " - \u0622\u064A\u0627\u062A\u0647\u0627: " + surah.total_verses.toString()
    });
  }
  // Perform action on the selected suggestion.
  onChooseSuggestion(surah, _evt) {
    new AyahModal(this.app, surah).open();
    new import_obsidian2.Notice(`Selected ${surah.name}`);
  }
};

// main.ts
var QuranHelper = class extends import_obsidian3.Plugin {
  async onload() {
    this.addRibbonIcon("book-open", "Insert Ayah", () => {
      new SurahModal(this.app).open();
    });
    this.addCommand({
      id: "open-quran-modal",
      name: "Insert Ayah",
      callback: () => {
        new SurahModal(this.app).open();
      }
    });
  }
  onunload() {
  }
};
